INSERT INTO `t1` (`serial`, `name`, `season`, `episode`, `seena`, `seens`, `sub`, `day`, `month`, `year`, `summary`, `pics`, `ppt`, `rating`) VALUES
	('13 Reasons Why', 'Tape 1, Side A', 1, 1, 'Yes', 'Yes', 'No', 31, 3, 2017, 'As the school mourns the death of Hannah Baker, her friend Clay receives a box of tapes with messages she recorded before she committed suicide.', 'N', 'N', 8.6),
	('13 Reasons Why', 'Tape 1, Side B', 1, 2, 'Yes', 'Yes', 'No', 31, 3, 2017, 'Hannah makes friends with Jessica and Alex, two other new students. Justin doesn\'t show up at school, and Hannah\'s mother finds something troubling.', 'N', 'N', 8.3),
	('13 Reasons Why', 'Tape 2, Side A', 1, 3, 'Yes', 'Yes', 'No', 31, 3, 2017, 'Jealousy and gossip take a toll on Hannah\'s relationships. As Alex struggles with feelings regret, the guys pressure Clay into getting drunk.', 'N', 'N', 8.2),
	('13 Reasons Why', 'Tape 2, Side B', 1, 4, 'Yes', 'Yes', 'No', 31, 3, 2017, 'Hannah thinks someone is stalking her and sets a trap. Hannah\'s mother confronts the principal, and Clay strikes back at someone who wronged Hannah.', 'N', 'N', 8.4),
	('13 Reasons Why', 'Tape 3, Side A', 1, 5, 'Yes', 'Yes', 'No', 31, 3, 2017, 'Hannah and Clay connect at the school dance, but a crass rumor ruins the mood. Clay takes Courtney to visit Hannah\'s grave.', 'N', 'N', 8.5),
	('13 Reasons Why', 'Tape 3, Side B', 1, 6, 'Yes', 'Yes', 'No', 31, 3, 2017, 'Hannah\'s date on Valentine\'s Day doesn\'t go as planned. Alex gets in a big fight at school and has to face the honor board.', 'N', 'N', 8.4),
	('13 Reasons Why', 'Tape 4, Side A', 1, 7, 'Yes', 'Yes', 'No', 31, 3, 2017, 'Another student sabotages Hannah during a class project. Clay\'s nightmares about Hannah spill over into the daytime.', 'N', 'N', 8.7),
	('13 Reasons Why', 'Tape 4, Side B', 1, 8, 'Yes', 'Yes', 'No', 31, 3, 2017, 'Inspired by a friend\'s poetry reading, Hannah pours her heart out. Tony confides in Clay about the night of Hannah\'s death.', 'N', 'N', 8.5),
	('13 Reasons Why', 'Tape 5, Side A', 1, 9, 'Yes', 'Yes', 'No', 31, 3, 2017, 'Hannah witnesses a traumatic event at a summertime party. Clay tries to reason with Justin, and Marcus warns him that the worst is yet to come.', 'N', 'N', 8.9),
	('13 Reasons Why', 'Tape 5, Side B', 1, 10, 'Yes', 'Yes', 'No', 31, 3, 2017, 'A distraught Hannah gets a ride home from the party. Jessica\'s behavior grows increasingly erratic, and Clay learns the truth behind a tragedy.', 'N', 'N', 8.9),
	('13 Reasons Why', 'Tape 6, Side A', 1, 11, 'Yes', 'Yes', 'No', 31, 3, 2017, 'Clay and Hannah grow closer. While Clay spends a heartbreaking night listening to his tape with Tony, tensions boil over at Bryce\'s house.', 'N', 'N', 9.3),
	('13 Reasons Why', 'Tape 6, Side B', 1, 12, 'Yes', 'Yes', 'No', 31, 3, 2017, 'Hannah winds up at a party after an argument with her parents. The students are served with subpoenas, and Justin wrestles with conflicting loyalties.', 'N', 'N', 9.3),
	('13 Reasons Why', 'Tape 7, Side A', 1, 13, 'Yes', 'Yes', 'No', 31, 3, 2017, 'Hannah seeks help from Mr. Porter, the school counselor. Clay plays the new tape for Tony and weighs what to do next.', 'N', 'N', 9.4),
	('24', '12.00 A.M - 01.00 A.M', 1, 1, 'Yes', 'Yes', 'No', 6, 11, 2001, 'It is California Presidential Primary Day in Los Angeles and the longest day of Federal Agent Jack Bauer\'s life is about to begin. Jack has just patched his family back together after a trying separation. Midnight finds Jack playing chess with his teenage daughter Kim. As she goes to bed, Jack gets a call from Nina Myers, his coworker at the Los Angeles Counter Terrorist Unit, telling him to come in for an emergency meeting. Jack has no choice but to report in, but he and his wife Teri learn that Kim has snuck out before he leaves. Kim and her friend Janet York drive to an empty furniture store where they party with a couple of college guys whom they recently met. Kim enjoys herself at first, but starts to become suspicious of the two men when they won\'t take her home. At CTU, Jack learns that an assassination attempt is being planned against Senator David Palmer; the first African-American presidential candidate with a serious shot at the White House. Jack\'s boss and friend, Richard Walsh, warns him that people in their own agency may be working with those who plan to kill Palmer. Senator David Palmer is making his plans for Primary Day when he receives a strange phone call that puts him in a bad mood. Jack shows how far he\'s willing to go to do his job when he blackmails District Director George Mason in the hopes of learning information about the Palmer hit. Teri receives a call from Janet\'s father, Alan York, and the two decide to go out looking for the girls. A European photographer makes pleasant conversation with a beautiful woman on a plane bound for LA. The two end up in a lustful encounter, but more sinister plans come to light that involve a stolen wallet and the destruction of the airplane.', 'Y', 'N', 8.6),
	('24', '01.00 A.M - 02.00 A.M', 1, 2, 'Yes', 'Yes', 'No', 13, 11, 2001, 'Jack\'s plans to find Kim are sidetracked when he gets a call from Walsh, who is being stalked by assassins connected with the Palmer hit. Jack comes to Walsh\'s rescue and Walsh gives him a key card containing valuable information. Palmer learns of the possible threat against his life, but slips away from his security in order to learn more about a damaging story that is about to hit the press. Dan and Rick start to become violent when Kim refuses to make a phone call for them. Mandy meets with the man behind the Palmer hit, but her partner holds things up when she demands more money for the ID.', 'Y', 'N', 8.5),
	('24', '02.00 A.M - 03.00 A.M', 1, 3, 'Yes', 'Yes', 'No', 20, 11, 2001, 'Jack learns the identity of the agent who may be working against him. He acquires Jamie\'s help to get evidence. Palmer finally learns of the damning story about to hit the press, involving his son and a possible murder several years ago. Kim and Janet manage to escape their captors. Kim is able to get a message to Teri, but an accident results in her recapture. Tony calls for outside help when he decides that Jack should be relieved of his command.', 'Y', 'N', 8.4),
	('24', '03.00 A.M - 04.00 A.M', 1, 4, 'Yes', 'Yes', 'No', 27, 11, 2001, 'Jack breaks out of a locked down CTU so he can follow a lead from the key card. George Mason puts pressure on Jamie and Nina to learn of Jack\'s whereabouts. Palmer discovers who the source is that leaked the story about his son. Rick and Dan argue about how to handle Janet, while Teri and Alan run into an obstacle as they try to help their daughters.', 'Y', 'N', 8.4),
	('24', '04.00 A.M - 05.00 A.M', 1, 5, 'Yes', 'Yes', 'No', 11, 12, 2001, 'Jack takes drastic action to gain the cooperation of the only man who knows how to save Kim, but Mason\'s interference threatens to ruin Jack\'s advantage. Kim is delivered to Gaines and she learns just how ruthless he can be when he\'s crossed. Meanwhile, Teri and Alan watch over Janet in surgery. Palmer talks to the reporter who plans to break the story about Keith and she shows him proof to back up her claims.', 'Y', 'N', 8.4),
	('24', '05.00 A.M - 06.00 A.M', 1, 6, 'Yes', 'Yes', 'No', 18, 12, 2001, 'Jack and Teri are reunited at the hospital. Jack plans to question Janet when she wakes up, but he is interrupted when Gaines contacts him and begins forcing Jack to follow his orders. Palmer is angered when he learns that his family went to great lengths to conceal the truth from him. Kim tries to persuade Rick to help her escape from Gaines. Teri receives a message from Nina and discovers that she is in more danger than she realized.', 'Y', 'N', 8.7),
	('24', '06.00 A.M - 07.00 A.M', 1, 7, 'Yes', 'Yes', 'No', 8, 1, 2002, 'Jack is now under Gaines\' control and is forced to sabotage operations at CTU. Nina becomes suspicious of Jack and gets in his way. Teri pulls a surprise attack on her kidnapper, but she makes the wrong move and finds herself in more trouble than ever. Palmer tries to persuade his family to go public with the story before the press can report it.', 'Y', 'N', 8.7),
	('24', '07.00 A.M - 08.00 A.M', 1, 8, 'Yes', 'Yes', 'No', 15, 1, 2002, 'Nina and Tony discover the identity of the mole who is working for Gaines. Teri and Kim are finally reunited. Still under Gaines\' control, Jack goes to the Palmer breakfast, where he learns what Gaines has planned for him. Jack manages to foil the assassination attempt, but is captured by Secret Service in the process.', 'Y', 'N', 8.8),
	('24', '08.00 A.M - 09.00 A.M', 1, 9, 'Yes', 'Yes', 'No', 22, 1, 2002, 'Jack tries to explain his situation to Secret Service, but they are unwilling to release him. He manages to escape and hides out with a hostage while contacting CTU. Nina and Tony turn up the pressure on Jamey and finally learn about Gaines, but tragedy strikes before they can act. Teri sacrifices herself to save Kim from a brutal experience.', 'Y', 'N', 8.6),
	('24', '09.00 A.M - 10.00 A.M', 1, 10, 'Yes', 'Yes', 'No', 5, 2, 2002, 'Teri manages to call CTU using a stolen cell phone. She and Jack have an emotional conversation, but her signal dies before the call can be traced. Nina and Tony find themselves facing a new boss, Alberta Green, as they continue to secretly help Jack. Palmer\'s political associates begin to sweat as Carl plans to take serious action against Keith\'s therapist. Jack uncovers a new name from the key card that may lead him to Gaines.', 'Y', 'N', 8.5),
	('24', '10.00 A.M - 11.00 A.M', 1, 11, 'Yes', 'Yes', 'No', 12, 2, 2002, 'Palmer begins to form a connection between himself and Jack Bauer. Gaines meets with Drazen, the man behind the Palmer assassination plot. Drazen gives Gaines an unpleasant ultimatum that will result in the deaths of Teri and Kim. Jack\'s interrogation of Cofell goes awry, but he discovers another familiar face who can lead him to his family.', 'Y', 'N', 8.7),
	('24', '11.00 A.M - 12.00 P.M', 1, 12, 'Yes', 'Yes', 'No', 19, 2, 2002, 'Jack sneaks into the compound and rescues his family, but Gaines catches on to him and gives chase. Jack and his family are attacked by Gaines and his men, causing them to become separated. Palmer tries to talk to Keith\'s therapist, but discovers that Carl has been there before him. Green tries to turn Nina and Tony against one another.', 'Y', 'N', 8.9),
	('24', '12.00 P.M - 01.00 P.M', 1, 13, 'Yes', 'Yes', 'No', 26, 2, 2002, 'Jack plays a deadly game of cat and mouse with Gaines that results in a final confrontation. CTU arrives on the scene and flies Jack and his family to safety. Palmer plans to talk to the D.A. about Ferragamo\'s murder, but a threat from Carl changes his mind. Nina discovers that a second assassin has arrived in LA, which means that Palmer\'s life is still in danger.', 'Y', 'N', 8.7),
	('24', '01.00 P.M - 02.00 P.M', 1, 14, 'Yes', 'Yes', 'No', 5, 3, 2002, 'Jack is forced to leave his family when Green places him under arrest and holds him at CTU. Once there, Jack must explain his actions to District Director Ryan Chappelle. Nina accompanies Teri and Kim to a clinic, where they are given a medical examination. Nina becomes suspicious of a phony FBI agent and decides to move the women to a safehouse. Palmer goes to CTU and demands a meeting with Jack.', 'Y', 'N', 8.3),
	('24', '02.00 P.M - 03.00 P.M', 1, 15, 'Yes', 'Yes', 'No', 12, 3, 2002, 'Jack and Palmer finally meet face to face and learn of their connection through Operation Nightfall. They work together to track down those who are seeking revenge on them. A member of Palmer\'s staff has a romantic encounter with the would-be assassin. Teri and Nina have a revealing conversation about Jack at the safehouse.', 'Y', 'N', 8.4),
	('24', '03.00 P.M - 04.00 P.M', 1, 16, 'Yes', 'Yes', 'No', 19, 3, 2002, 'Keith takes matters into his own hands when he arranges a secret meeting with Carl. Elizabeth realizes who Alexis really is and immediately comes forward. Jack and Mason question her and then convince her to aid in his capture. The safe house is attacked, but Teri and Kim manage to escape. They are then separated by an unforeseen accident.', 'Y', 'N', 8.3),
	('24', '04.00 P.M - 05.00 P.M', 1, 17, 'Yes', 'Yes', 'No', 26, 3, 2002, 'Teri is struck with amnesia and must turn to an old friend for help. Kim goes to Rick\'s house in hopes of finding a lead. Jack sets Elizabeth up for a sting against Alexis, but she pulls a fast one at the last second.', 'Y', 'N', 8.4),
	('24', '05.00 P.M - 06.00 P.M', 1, 18, 'Yes', 'Yes', 'No', 2, 4, 2002, 'Palmer and Sherry clash over the handling of the evidence against Carl. Kim finds herself in a sticky situation with Dan\'s brother. Jack poses as Alexis and meets with a stranger who has vital information, but an agent with a grudge from Jack\'s past picks a bad time to get even. Teri and Dr. Phil return to the Bauer home, putting themselves in further danger.', 'Y', 'N', 8.3),
	('24', '06.00 P.M - 07.00 P.M', 1, 19, 'Yes', 'Yes', 'No', 9, 4, 2002, 'Jack and Mason investigate the area where the power was to be turned off. Nina tries to warn Jack about his family\'s disappearance, but Mason hampers her efforts. Teri explores her home in hopes of regaining her memory as Drazen\'s man closes in for the kill. Kim finds herself in the middle of a botched drug deal, while Palmer breaks the story about Keith to the press.', 'Y', 'N', 8.6),
	('24', '07.00 P.M - 08.00 P.M', 1, 20, 'Yes', 'Yes', 'No', 16, 4, 2002, 'Kim lands in jail when the cops don\'t believe her story.', 'Y', 'N', 8.8),
	('24', '08.00 P.M - 09.00 P.M', 1, 21, 'Yes', 'Yes', 'No', 23, 4, 2002, 'Palmer is relieved when it seems that he has dominated in the California polls in spite of his crisis. Jack becomes locked in a stalemate with the Drazens. They manage to turn the tables and take Jack as a hostage as they escape. Kim is finally released from jail, but her freedom is all too brief when she is again abducted by terrorists.', 'Y', 'N', 8.5),
	('24', '09.00 P.M - 10.00 P.M', 1, 22, 'Yes', 'Yes', 'No', 7, 5, 2002, 'The Drazens contact Mason and offer to trade Jack for Alexis. Mason is reluctant, but Palmer pressures him to go ahead with the deal. Nina and Tony try to distract Teri when they learn of Kim\'s abduction. Palmer is tempted by a member of his staff.', 'Y', 'N', 8.5),
	('24', '10.00 P.M - 11.00 P.M', 1, 23, 'Yes', 'Yes', 'No', 14, 5, 2002, 'The Drazens threaten to kill Kim unless Jack pays Palmer a visit. Jack complies and is able to save Palmer\'s life once again. Jack then agrees to trade his life for Kim\'s since the Drazens believe Palmer is dead. Kim manages to escape from the Drazens and swims to safety. Teri tells Jack about her unexpected good news. A second mole is revealed inside CTU.', 'Y', 'N', 9),
	('24', '11.00 P.M - 12.00 A.M', 1, 24, 'Yes', 'Yes', 'No', 21, 5, 2002, 'Palmer has had enough of Sherry\'s power plays and has a final showdown with her in the hotel ballroom. Nina knows that the Drazens have no leverage without Kim, so she calls Jack and tells him that Kim\'s body was found floating in the harbor. Jack is crushed by grief and then he flies into a rage. He rushes the Drazens and a bloody shoot-out ensues. Nina\'s cover is blown and she makes a final dash for safety, leaving a bloody trail behind her. Jack is able to apprehend her before she can escape, but he is stunned to learn that he didn\'t arrive soon enough.', 'Y', 'N', 9.4),
	('24', '08.00 A.M - 09.00 A.M', 2, 1, 'Yes', 'Yes', 'No', 29, 10, 2002, 'Over a year has passed since the events of Day One. President David Palmer is fishing with his son in Oregon when he learns of an emergency. He is taken to his underground bunker, where he learns that a Middle Eastern terrorist group known as Second Wave is planning to set off a nuclear bomb in Los Angeles sometime that day. At CTU, George Mason is ordered to contact Jack Bauer, who may be able to provide a lead to the terrorists. Jack has been out of commission since the death of his wife. He is also estranged from his daughter Kim, who is now working as an au pair. He isn\'t interested in returning to work, but changes his mind when Palmer personally requests his help. Kim overhears her boss abusing his wife, so she locks herself and their little girl in the bedroom. Gary forces his way in and attacks Megan. A young girl named Marie is marrying a man who may have connections to the leader of the terrorist group. At CTU, Jack learns that the key to finding the bomb rests with a group of American terrorists whom he infiltrated once before.', 'Y', 'N', 8.5),
	('24', '09.00 A.M - 10.00 A.M', 2, 2, 'Yes', 'Yes', 'No', 5, 11, 2002, 'Jack works to establish his cover with a small group of domestic terrorists. He learns that their target hits very close to home. Kim takes Megan and runs from the house, but Gary pursues them. Palmer and Eric disagree over how to deal with the media during the nuclear threat.', 'Y', 'N', 8.4),
	('24', '10.00 A.M - 11.00 A.M', 2, 3, 'Yes', 'Yes', 'No', 12, 11, 2002, 'Jack warns Lynne about the impending bombing of CTU, but her efforts to alert Palmer are sabotaged by Eric, who has his own agenda. George locates the warehouse where the nuclear bomb was built, but his discovery results in an unexpected tragedy. Kim takes Megan to CTU, believing that it is the safest place for both of them.', 'Y', 'N', 8.8),
	('24', '11.00 A.M - 12.00 P.M', 2, 4, 'Yes', 'Yes', 'No', 19, 11, 2002, 'The gang is amazed to learn that Phoebe married a gay Canadian ice dancer to help him get his green card. And Ross seeks relationship advice from Rachel after revealing that he and Julie have yet to consummate their relationship.', 'Y', 'N', 8.7),
	('24', '12.00 P.M - 01.00 P.M', 2, 5, 'Yes', 'Yes', 'No', 26, 11, 2002, 'George refuses to allow Jack to assist in Nina\'s interrogation. Jack resorts to blackmail to change George\'s mind.Palmer and Stanton meet with a Middle Eastern ambassador who may be in league with Second Wave. Tony visits the Warner home and questions Reza about his possible connection with Syed Ali.', 'Y', 'N', 8.4),
	('24', '01.00 P.M - 02.00 P.M', 2, 6, 'Yes', 'Yes', 'No', 3, 12, 2002, 'Jack begins his interrogation of Nina and pushes all boundaries in order to force her to divulge the name of her contact. Palmer is surprised and suspicious when his ex wife Sherry returns and claims to have information about a conspiracy against him from within his own administration. Kim and Miguel plan to kidnap Megan from the hospital in order to take her out of LA and away from the nuclear threat. ', 'Y', 'N', 8.6),
	('24', '02.00 P.M - 03.00 P.M', 2, 7, 'Yes', 'Yes', 'No', 10, 12, 2002, 'Jack forces Nina to help with a sting operation against her contact in the hopes that he can lead them to the bomb. Palmer and Mike try to gage Stanton\'s loyalty when they investigate the chopper crash. George has a final conversation with his son.', 'Y', 'N', 8.7),
	('24', '03.00 P.M - 04.00 P.M', 2, 8, 'Yes', 'Yes', 'No', 17, 12, 2002, 'Kim and Miguel are arrested and the police plan to take them back to LA. Tony questions Bob Warner at CTU and learns more about his government connections. Palmer discovers a traitor in his ranks when the journalist whom he was holding is set free. Nina pulls a deadly countermove, setting herself up as the main player in the search to locate the bomb.', 'Y', 'N', 8.6),
	('24', '04.00 P.M - 05.00 P.M', 2, 9, 'Yes', 'Yes', 'No', 14, 1, 2003, 'George pits Bob against Reza in hopes of learning which one is working with Second Wave. Sherry and Lynne clash over Palmer\'s speech to the press. Kate is interrogated by Syed Ali, who believes she knows too much about the bomb. Jack and Nina fight off a group of renegade soldiers while waiting to be rescued from the crash site. They nearly escape when Nina takes Jack hostage and demands to speak to the President.', 'Y', 'N', 8.9),
	('24', '05.00 P.M - 06.00 P.M', 2, 10, 'Yes', 'Yes', 'No', 21, 1, 2003, 'Two traitors are uncovered. One is the mole in the Palmer administration who is working with Stanton. The other is the member of the Warner family who helped Syed Ali to bring the bomb into the country. Jack learns of Ali\'s location and tries to rescue Kate. Kim and Miguel hatch an escape plan to stay out of LA, but the results are disastrous.', 'Y', 'N', 8.9),
	('24', '06.00 P.M - 07.00 P.M', 2, 11, 'Yes', 'Yes', 'No', 4, 2, 2003, 'Kate helps Jack to locate and identify Syed Ali. Palmer places Stanton under arrest, but he won\'t break. Palmer realizes he must go to extremes to make Stanton talk. Kim hits her low point of the day when she encounters a cougar in the woods.', 'Y', 'N', 8.5),
	('24', '07.00 P.M - 08.00 P.M', 2, 12, 'Yes', 'Yes', 'No', 11, 2, 2003, 'Jack engages in a brutal contest of wills with Syed Ali. George questions Bob Warner to learn more about Marie\'s motivations for helping the terrorists. Kim is rescued by a mysterious hunter who offers her asylum. Lynne receives a dire warning from Sherry', 'Y', 'N', 8.8),
	('24', '08.00 P.M - 09.00 P.M', 2, 13, 'Yes', 'Yes', 'No', 18, 2, 2003, 'Jack and his men prepare for a confrontation with Stanton\'s renegade soldiers as they converge on the bomb. Kim becomes suspicious of her host, but is forced to stay because of her status with the police. Stanton finally breaks down and gives Palmer some unpleasant news.', 'Y', 'N', 8.6),
	('24', '09.00 P.M - 10.00 P.M', 2, 14, 'Yes', 'Yes', 'No', 25, 2, 2003, 'Jack and Kate try to break Marie\'s resolve so they can learn the location of the bomb. Palmer confronts his ex wife with the information that Stanton gave them. George finally steps down as director of CTU and hands the position over to Tony. Kim discovers her host\'s deception.', 'Y', 'N', 8.7),
	('24', '10.00 P.M - 11.00 P.M', 2, 15, 'Yes', 'Yes', 'No', 4, 3, 2003, 'Palmer, Mike and Lynne discuss various ways to dispose of the ticking bomb. They conclude that the desert is the best place to set it off. Jack determines that one man must pilot the plane carrying the bomb. He chooses to fly the plane himself and bids a tearful goodbye to his daughter. Tony and Michelle become suspicious of a Middle Eastern diplomat who is asking questions about the evidence against Syed Ali. Palmer departs for Los Angeles so he can be on hand when news of the nuclear bomb reaches the public.', 'Y', 'N', 9.2),
	('24', '11.00 P.M - 12.00 A.M', 2, 16, 'Yes', 'Yes', 'No', 25, 3, 2003, 'Jack and Michelle question Syed Ali, who claims that the audio recordings are false. Palmer prepares to wage war against the three countries who were involved in the nuclear strike. Kim gets caught in a hostage situation. Jack is contacted by a man who wants to exchange information for Kate Warner.', 'Y', 'N', 8.6),
	('24', '12.00 A.M - 01.00 A.M', 2, 17, 'Yes', 'Yes', 'No', 1, 4, 2003, 'Jack meets with the surviving Coral Snake Commando, who demands Kate Warner in exchange for evidence about the recordings. Tony and Carrie spy on Michelle when he suspects that she is working with Jack. Mike and the Vice-President turn up the pressure on Palmer, when he expresses his doubts about the impending war.', 'Y', 'N', 8.4),
	('24', '01.00 A.M - 02.00 A.M', 2, 18, 'Yes', 'Yes', 'No', 8, 4, 2003, 'Jack, Kate and Wallace fight to escape from a deadly band of commandos. Palmer decides to take a stronger stance against the civil unrest resulting from the bomb explosion. Tony\'s trust in Michelle is broken when he suspects her of betraying him. Kim\'s worries seem to be over when she learns the charges against her have been dropped.', 'Y', 'N', 8.7),
	('24', '02.00 A.M - 03.00 A.M', 2, 19, 'Yes', 'Yes', 'No', 15, 4, 2003, 'Jack is captured and tortured by men who want the chip. Kate and Yusuf run into a group of angry rednecks before they can deliver the chip to CTU. Tony and Michelle share a tender moment after her brother flips out. Palmer leans towards holding off the attacks, while Lynne discovers a secret operation that the Vice-President is planning against Palmer.', 'Y', 'N', 8.6),
	('24', '03.00 A.M - 04.00 A.M', 2, 20, 'Yes', 'Yes', 'No', 22, 4, 2003, 'Jack finds an ally who may help him escape from Kingsley\'s men. Lynne meets with foul play before she can warn Palmer of the conspiracy against him. Chappelle interferes with Tony\'s efforts to assist Jack. Kate offers her captors money in exchange for the chip.', 'Y', 'N', 8.7),
	('24', '04.00 A.M - 05.00 A.M', 2, 21, 'Yes', 'Yes', 'No', 29, 4, 2003, 'Palmer\'s cabinet invokes the 25th Amendment in an attempt to remove him from power. They place him on trial for his extreme actions during the nuclear bomb threat. Jack and Michelle work against the clock to prove that the evidence against the Middle East is false.', 'Y', 'N', 8.7),
	('24', '05.00 A.M - 06.00 A.M', 2, 22, 'Yes', 'Yes', 'No', 6, 5, 2003, 'Jack locates the man who forged the audio evidence, but his efforts to break him down are sabotaged by Sherry Palmer, who has a hand in the conspiracy. Kim returns to the Matheson home, where she discovers that her problems are far from over. Palmer searches for an ally who will help him get a message out to CTU. Tony and Michelle take Chappelle out of action when he hinders their efforts to help Jack.', 'Y', 'N', 8.8),
	('24', '06.00 A.M - 07.00 A.M', 2, 23, 'Yes', 'Yes', 'No', 13, 5, 2003, 'When Jack hits a dead end with his lead, he realizes he must persuade Sherry to help him get evidence against Kingsley. Things go awry at CTU when Division becomes suspicious of Chappelle\'s absence. Michelle goes off-site to work with Jack. Mike and Prescott ask Palmer to aid them as the bombers get closer to their targets.', 'Y', 'N', 8.8),
	('24', '07.00 A.M - 08.00 A.M', 2, 24, 'Yes', 'Yes', 'No', 20, 5, 2003, 'Jack uses Sherry to lure Kingsley out into the open, but Kingsley suspects a set-up and lays his own trap. Kate and her father have a final, ominous conversation with Marie. Palmer\'s attorney finds evidence involving Kingsley and convinces Mike to release Palmer from custody. Palmer and his cabinet gather to watch as Sherry meets with Kingsley. Mike orders Chappelle to reinstate Tony and Michelle. Jack sends Sherry in for the meeting with Kingsley, but his mounting heart troubles cause problems for him at the crucial moment.', 'Y', 'N', 9.2),
	('24', '01.00 P.M - 02.00 P.M', 3, 1, 'Yes', 'Yes', 'No', 28, 10, 2003, 'Three years have passed since the events of Day Two. A van deposits a dead body outside the LA Health Unit. The body is infected with a deadly virus. Tony, now in charge of CTU, learns that this is a blackmail tactic to get the US government to release a drug lord, Ramon Salazar, whom Jack has just brought down, before Salazar\'s brother releases the virus into LA. Jack and his new partner, Chase Edmunds, prepare to sign a deal with Salazar at the prison. Salazar delivers a mysterious warning to Jack before killing his lawyer. Palmer is alive and well, and has returned to LA for the first time since the attack three years ago. He is running for re-election and is preparing for an important debate with a rival senator. He is accompanied by his brother, who happens to be his chief of staff and his doctor, who also happens to be his girlfriend. A young boy, Kyle Singer, is seen examining a large, mysterious bag of white powder. He plans to deliver it to some dealers later that day, but he is being watched by Salazar\'s men. Kim now works at CTU and has been dating Chase for three months. Kim wants to tell her father, but Jack has a mysterious health problem that may make things more complicated.', 'Y', 'N', 8.3),
	('24', '02.00 P.M - 03.00 P.M', 3, 2, 'Yes', 'Yes', 'No', 4, 11, 2003, 'Jack and Chase quarrel over Chase\'s relationship with Kim. Meanwhile, they learn of a lead to the possible whereabouts of the virus after rading a crackhouse. Linda breaks up with Kyle when she learns that he is planning to make a drug delivery. Wayne approaches Palmer with information about his girlfriend that could damage his chances for reelection, while a CTU employee is not what he seems.', 'Y', 'N', 8.3),
	('24', '03.00 P.M - 04.00 P.M', 3, 3, 'Yes', 'Yes', 'No', 11, 11, 2003, 'Jack and Hector both search for Kyle, while Chase finds himself out of action at CTU. Wayne and Palmer argue over the implications of Anne\'s past, while Ramon takes out one of his opponents in a surprise move. Tony leads an operation to get Kyle, but tragedy strikes when Salazar\'s man gets there first.', 'Y', 'N', 8.6),
	('24', '04.00 P.M - 05.00 P.M', 3, 4, 'Yes', 'Yes', 'No', 18, 11, 2003, 'Michelle is torn by personal and professional obligations when she must take charge of CTU after Tony is wounded. Kyle and Linda are captured by Hector\'s men. Jack and Palmer have a secret conversation, leading Jack to take drastic action in the face of the Salazars\' threat. But Jack\'s plans are complicated when Chase gets in the way. Anne pushes Palmer back on to moral ground in the face of her ex husband\'s blackmail scheme.', 'Y', 'N', 8.6),
	('24', '05.00 P.M - 06.00 P.M', 3, 5, 'Yes', 'Yes', 'No', 25, 11, 2003, 'Jack\'s efforts to break Ramon out of prison go awry when they are captured by a group of inmates during the riot. Chloe unwittingly stumbles on to Jack\'s drug problem and she is forced to reveal his secret to Kim and Michelle. Palmer begins his debate with Keeler, while Kyle prepares to sacrifice himself to save Linda.', 'Y', 'N', 8.7),
	('24', '06.00 P.M - 07.00 P.M', 3, 6, 'Yes', 'Yes', 'No', 2, 12, 2003, 'Jack and Ramon struggle to evade the authorities, while Palmer must shut the debate down because of the prison break. Kim accidentally stumbles on to Gael\'s secret communications, but she isn\'t able to warn Michelle in time. The Singer family learns a startling piece of news about Kyle\'s health.', 'Y', 'N', 8.5),
	('24', '07.00 P.M - 08.00 P.M', 3, 7, 'Yes', 'Yes', 'No', 9, 12, 2003, 'Ramon holds Jack hostage as he flies to Mexico. Ramon plans to kill Jack, but Jack manages to hold him at bay until the plane lands. Ramon then learns that Jack and Hector are working together to break him out of prison. Gael is captured while trying to escape from CTU. Chappelle interrogates Gael but is interrupted by Tony, who claims that Gael is part of a bigger plan. Anne is given a chance to clear Palmer\'s name, while Chase heads for Mexico to rescue Jack.', 'Y', 'N', 8.8),
	('24', '08.00 P.M - 09.00 P.M', 3, 8, 'Yes', 'Yes', 'No', 16, 12, 2003, 'Palmer and Chappelle view a message from Jack, explaining his undercover work with the Salazars. Meanwhile, Hector tries to convince Ramon that they should deal with Bauer so that they can get their hands on the virus. Jack has a private moment with Claudia and she blasts him for leaving her behind when he arrested Ramon. Chase arrives in Mexico, but is captured by Hector\'s men. Ramon devises a way for Jack to prove his loyalty to them. Anne manages to clear Palmer\'s name, but she breaks off her relationship with him.', 'Y', 'N', 8.6),
	('24', '09.00 P.M - 10.00 P.M', 3, 9, 'Yes', 'Yes', 'No', 6, 1, 2004, 'Palmer clears Anne\'s name with the press, but he finds that he is facing a new problem when his biggest campaign contributer reveals a startling secret about Wayne. Kim and Michelle worry about Tony\'s mental ability when he continues to make mistakes. Jack and the Salazars meet with Amador, but the deal turns sour when Nina Myers appears on the scene and competes for the virus.', 'Y', 'N', 8.5),
	('24', '10.00 P.M - 11.00 P.M', 3, 10, 'Yes', 'Yes', 'No', 13, 1, 2004, 'Claudia manages to free Chase from his captors, but she pays a high price for her efforts. Wayne turns to Julia, while Palmer calls on Sherry for help against Milliken. Jack and Ramon make plans to get to Nina, in the hopes of intercepting the virus. Chloe\'s work at CTU is disrupted when she is forced to take care of her baby.', 'Y', 'N', 8.6),
	('24', '11.00 P.M - 12.00 A.M', 3, 11, 'Yes', 'Yes', 'No', 27, 1, 2004, 'Jack forces Nina to work with him in order to get the virus from Amador. Palmer meets with Sherry and convinces her to help him deal with Milliken. Chase remains in Mexico to help with the capture of the virus. Ramon and Hector quarrel when Hector wants to pull out of the deal.', 'Y', 'N', 8.5),
	('24', '12.00 A.M - 01.00 A.M', 3, 12, 'Yes', 'Yes', 'No', 3, 2, 2004, 'Things finally come to an explosive head as Jack, Ramon, Nina and Chase all close in on the virus. But the deal takes an unexpected turn when Amador pulls a fast switch. Kim becomes suspicious of Chloe when her story about her baby doesn\'t check out. Sherry finds a witness who can damage Milliken, but her advantage is short lived.', 'Y', 'N', 8.8),
	('24', '01.00 A.M - 02.00 A.M', 3, 13, 'Yes', 'Yes', 'No', 10, 2, 2004, 'Jack and Chase interrogate Nina, but the worm turns when she causes havoc with the CTU computer systems. Chappelle puts Chloe under guard when she refuses to answer questions about the baby, but is forced to release her when she is the only one who can deal with the crisis. Sherry takes her battle directly to Alan, forcing Julia to act as her accomplice.', 'Y', 'N', 8.8),
	('24', '02.00 A.M - 03.00 A.M', 3, 14, 'Yes', 'Yes', 'No', 17, 2, 2004, 'Tony interrogates Nina about Alvers\' location, while Chappelle orders Jack to undergo a medical examination in light of his drug use. Kim and Chase have a conversation about the baby. Palmer confronts Sherry about Alan Milliken\'s death, while Julia begs Wayne for help.', 'Y', 'N', 8.9),
	('24', '03.00 A.M - 04.00 A.M', 3, 15, 'Yes', 'Yes', 'No', 24, 2, 2004, 'Chappelle threatens to pull Jack from the investigation for killing a material witness, but Jack persuades him to hold off when they find a fresh lead on Amador\'s whereabouts. Amador and Alvers meet with the man who is planning to unleash the virus in LA within the hour. Michelle and Gael locate the target area, but things really hit the fan when they attempt to capture Alvers in the process of releasing the virus. Wayne argues with Sherry over the consequences of Milliken\'s death as the police turn up the heat on Julia.', 'Y', 'N', 8.7),
	('24', '04.00 A.M - 05.00 A.M', 3, 16, 'Yes', 'Yes', 'No', 30, 3, 2004, 'Jack and Chase track Amador in the hopes that he can lead them to the man behind the virus attack. Michelle faces a mob riot when the hotel is quarantined. Sherry extorts Palmer, forcing him to manufacture her alibi for the police.', 'Y', 'N', 8.8),
	('24', '05.00 A.M - 06.00 A.M', 3, 17, 'Yes', 'Yes', 'No', 6, 4, 2004, 'Saunders begins making demands on the President. He forces Palmer to hold a strange press conference and then orders the death of the CTU agent who can trace him. Jack learns of a woman who can lead him to Saunders, but a surprise attack shifts the balance of power. As Gael\'s symptoms get worse, Michelle devises a way to relieve the suffering of the victims at the hotel.', 'Y', 'N', 8.8),
	('24', '06.00 A.M - 07.00 A.M', 3, 18, 'Yes', 'Yes', 'No', 18, 4, 2004, 'Jack and Chase race against time to capture Saunders before the deadline, while Chappelle plans an escape. Michelle begins a frantic search when she learns that an infected hotel guest may have slipped through her fingers.', 'Y', 'N', 9.3),
	('24', '07.00 A.M - 08.00 A.M', 3, 19, 'Yes', 'Yes', 'No', 20, 4, 2004, 'Jack reluctantly works with Kim on an under-cover job that may help them gain an advantage over Saunders. Palmer informs his cabinet of the crisis, while Saunders makes yet another demand. Chase tracks down the man who left the hotel and learns that the virus is spreading to the general public.', 'Y', 'N', 8.7),
	('24', '08.00 A.M - 09.00 A.M', 3, 20, 'Yes', 'Yes', 'No', 27, 4, 2004, 'Jack attempts to use Saunders\' daughter as leverage to gain control of the virus, while Palmer must deal with the discontented press. Michelle gets the results of her test, while Adam finds that the virus has struck too close to home. Tony finds himself compromised when Saunders exploits his only weakness.', 'Y', 'N', 8.7),
	('24', '09.00 A.M - 10.00 A.M', 3, 21, 'Yes', 'Yes', 'No', 4, 5, 2004, 'Tony works to free Jane from CTU before Saunders can harm Michelle, but Chloe and Jack become suspicious of his activities. Sherry meets with Palmer\'s political rival and proposes a deal to blackmail him.', 'Y', 'N', 8.7),
	('24', '10.00 A.M - 11.00 A.M', 3, 22, 'Yes', 'Yes', 'No', 11, 5, 2004, 'Jack and Tony clash as the time for the hostage exchange draws near. Keeler meets with Palmer and demands his resignation, while Wayne begins a secret operation against Sherry.', 'Y', 'N', 9),
	('24', '11.00 A.M - 12.00 P.M', 3, 23, 'Yes', 'Yes', 'No', 18, 5, 2004, 'Jack pushes the envelope in an attempt to force Saunders to disclose the location of the missing vials. Sherry meets with David to discuss her terms, while Wayne breaks into her home to find the incriminating evidence. Tony finds himself facing a harsh penalty because of his efforts to save Michelle.', 'Y', 'N', 8.9),
	('24', '12.00 P.M - 01.00 P.M', 3, 24, 'Yes', 'Yes', 'No', 25, 5, 2004, 'Jack and Chase must make a powerful sacrifice when dealing with the virus. Tony is able to help Jack one last time before he is taken into custody, while an angry victim seeks vengeance on Saunders. Palmer makes a surprising career choice in the wake of Sherry\'s death.', 'Y', 'N', 9),
	('24', '07.00 A.M - 08.00 A.M', 4, 1, 'Yes', 'Yes', 'No', 9, 1, 2005, 'Eighteen months have elapsed since the conclusion of Day 3. A commuter train bound for Los Angeles explodes. A man steals a suitcase from a passenger in the wreckage and then kills him. Jack has been dismissed from CTU and now works for Secretary of Defense James Heller. Jack is involved with Heller\'s daughter, Audrey, and their relationship is growing serious. Jack is in LA for a meeting with CTU Director Erin Driscoll, who fired him a year ago, but he finds himself alienated at CTU by Driscoll and the new staff when reports of a possible terrorist strike come in. A young computer hacker named Andrew Paige sees something that he shouldn\'t on the Internet. Suddenly, he finds himself running for his life as he is pursued by terrorists. Luckily, he is able to warn Chloe O\'Brian before its too late. The Turkish Araz family are not what they seem and it becomes clear that they are heavily involved with the day\'s events. Meanwhile, Heller has a confrontation with his estranged son. Jack finds that Chloe is his only ally as he tries to prove that the train explosion is merely a diversionary target.', 'Y', 'N', 8.5),
	('24', '08.00 A.M - 09.00 A.M', 4, 2, 'Yes', 'Yes', 'No', 9, 1, 2005, 'Jack pushes Driscoll to reinstate him in the wake of Heller\'s kidnapping. He finds himself working as a subordinate when the Field Ops team goes to pick up Andrew. Behrooz finds himself torn between his loyalty to his parents and his feelings for his girlfriend as he is sent on his first assignment. Heller tries to comfort his daughter as his captors broadcast their intentions on the Internet.', 'Y', 'N', 8.3),
	('24', '09.00 A.M - 10.00 A.M', 4, 3, 'Yes', 'Yes', 'No', 10, 1, 2005, 'Jack tracks Kalil with Chloe\'s aid, but is forced to watch helplessly as Andrew is tortured for information. Behrooz pleads with his parents when they order him to bring Debbie to their home for questioning. Curtis uses harsh methods to interrogate Heller\'s son as Driscoll continues to search for Jack.', 'Y', 'N', 8.3),
	('24', '10.00 A.M - 11.00 A.M', 4, 4, 'Yes', 'Yes', 'No', 10, 1, 2005, 'Jack acts as a bandit and takes hostages to buy Chloe more time to get satellite surveillance. Meanwhile, Chloe must confide in Edgar for help when Driscoll becomes suspicious. Behrooz discovers just how far his mother is willing to go to insure that their secret mission is successful. Heller and Audrey attempt to escape from Omar, while Driscoll uses her influence to deal with a personal crisis.', 'Y', 'N', 8.3),
	('24', '11.00 A.M - 12.00 P.M', 4, 5, 'Yes', 'Yes', 'No', 17, 1, 2005, 'Jack and Driscoll agree to work together when the police make a critical error in dealing with Kalil. Heller and Audrey take drastic action in the hopes of avoiding the impending trial. Driscoll makes a deal with Chloe to get her out of the way, while the Araz family faces another problem in their cover-up.', 'Y', 'N', 8.3),
	('24', '12.00 P.M - 01.00 P.M', 4, 6, 'Yes', 'Yes', 'No', 24, 1, 2005, 'Jack initiates a fierce gun battle with the terrorists as he races to rescue Heller and Audrey before the military strike begins. Dina questions her own dedication to their cause when her husband reveals his plans for Behrooz. Driscoll and Curtis uncover new evidence that points to an even bigger attack by the terrorists. Audrey has an awkward meeting with her husband, and Heller butts heads once again with his son.', 'Y', 'N', 8.7),
	('24', '01.00 P.M - 02.00 P.M', 4, 7, 'Yes', 'Yes', 'No', 31, 1, 2005, 'Jack takes Audrey to ID the man she recognized at the compound, but the terrorists get there soon after and pin them down. Jack must call on an old friend to help him escape. Heller puts Edgar in charge of dealing with the nuclear override, while Driscoll\'s daughter takes a turn for the worse. Dina is wounded when she helps Behrooz flee from Navi. Navi\'s boss orders him to kill his wife and son before the day is over.', 'Y', 'N', 8.6),
	('24', '02.00 P.M - 03.00 P.M', 4, 8, 'Yes', 'Yes', 'No', 7, 2, 2005, 'Jack and Audrey hide out with an embittered Tony as Audrey makes a positive ID of the man from the kidnapping. Marianne successfully diverts suspicion from herself, leading Driscoll to torture the wrong person for information. Behrooz takes Dina to a hospital for medical attention, but the doctor becomes suspicious of her gunshot wound and phones the police.', 'Y', 'N', 8.7),
	('24', '03.00 P.M - 04.00 P.M', 4, 9, 'Yes', 'Yes', 'No', 14, 2, 2005, 'Jack and Tony are able to trace Dina\'s location, but Behrooz slips through their fingers. Dina demands a full pardon for her son in exchange for information on the override device. Edgar wrestles with his emotions when his mother is trapped in the path of the nuclear fall-out. Behrooz turns to his uncle for help, but Navi closes in on him before he can get away.', 'Y', 'N', 8.5),
	('24', '04.00 P.M - 05.00 P.M', 4, 10, 'Yes', 'Yes', 'No', 21, 2, 2005, 'Audrey places herself in a compromising position when she and Jack learn of her husband\'s possible involvement with the terrorists. Marianne offers Curtis information on the location of the override device in exchange for a lighter sentence, but the tables soon turn and Curtis discovers that there\'s another player in the game. Sarah bargains for a stronger position at CTU, while Tony takes charge of the interrogation of Dina and Behrooz.', 'Y', 'N', 8.3),
	('24', '05.00 P.M - 06.00 P.M', 4, 11, 'Yes', 'Yes', 'No', 28, 2, 2005, 'Jack and Curtis finally learn the location of the override device. They try to trap the architect of the terrorist strike before the remaining nuclear plants go critical. Tony pushes Dina to reveal more of her knowledge of Marwan, while Driscoll faces another personal crisis with her daughter.', 'Y', 'N', 8.6),
	('24', '06.00 P.M - 07.00 P.M', 4, 12, 'Yes', 'Yes', 'No', 7, 3, 2005, 'Jack and Paul visit the defense contractor who employed Marwan, but the company executives put their own interests ahead of CTU\'s and take major steps to destroy evidence. After a grief-stricken Driscoll relinquishes her command, Heller appoints Tony as interim director to oversee the latest crisis.', 'Y', 'N', 8.4),
	('24', '07.00 P.M - 08.00 P.M', 4, 13, 'Yes', 'Yes', 'No', 14, 3, 2005, 'Jack and Paul enlist civilian help when they must fight off soldiers sent to kill them by McLennan-Forster. Tensions flair between Tony and Michelle as she assumes command of CTU. Sarah tests Michelle\'s authority by giving her an ultimatum. Audrey reevaluates her feelings for Jack, while Marwan sets the next phase of his plan in motion.', 'Y', 'N', 8.5),
	('24', '08.00 P.M - 09.00 P.M', 4, 14, 'Yes', 'Yes', 'No', 21, 3, 2005, 'Jack learns the identity of a man who may be able to lead him to Marwan. He forces Dina to help him in a mock hostage situation that will get him close to the suspect. Michelle calls on Chloe for help when Edgar begins to crack under pressure. Meanwhile, Audrey stands by as a gravely wounded Paul is taken into surgery. Marwan\'s plan continues as his henchman uses an unwilling pilot to gain access to an airfield.', 'Y', 'N', 8.4),
	('24', '09.00 P.M - 10.00 P.M', 4, 15, 'Yes', 'Yes', 'No', 28, 3, 2005, 'Marwan decides to trade Jack for Behrooz in hopes of distracting CTU from his real objective. Tony and Michelle weigh the consequences of the trade, while Curtis reluctantly interrogates Behrooz in order to learn more about Marwan.', 'Y', 'N', 8.2),
	('24', '10.00 P.M - 11.00 P.M', 4, 16, 'Yes', 'Yes', 'No', 4, 4, 2005, 'CTU raids Marwan\'s hideout, but he manages to slip through their fingers. Luckily, Jack locates a lead that may help him identify Marwan\'s next target. Tony becomes suspicious of Michelle\'s personal life, while Audrey reunites with Paul and learns the extent of his injuries. Anderson closes in on his quarry, as President Keeler searches for words that will comfort the American public.', 'Y', 'N', 8.8),
	('24', '11.00 P.M - 12.00 A.M', 4, 17, 'Yes', 'Yes', 'No', 11, 4, 2005, 'Mike pushes for the Vice-President to be sworn into office as the White House waits for news of Keeler\'s fate. Two innocent bystanders are dragged into the fight as Jack and Marwan both pursue a briefcase that contains the launch codes for America\'s nuclear arsenal.', 'Y', 'N', 8.6),
	('24', '12.00 A.M - 01.00 A.M', 4, 18, 'Yes', 'Yes', 'No', 18, 4, 2005, 'Curtis brings in a suspect who has critical information about Marwan\'s next strike. Michelle orders Curtis to use harsh methods to interrogate the suspect, but things get complicated when Marwan sends a lawyer to defend his rights. Logan\'s advisors begin to worry as he continues to exhibit fear in the face of the ongoing terrorist threat.', 'Y', 'N', 8.3),
	('24', '01.00 A.M - 02.00 A.M', 4, 19, 'Yes', 'Yes', 'No', 25, 4, 2005, 'Chloe is unexpectedly thrust into fieldwork when a woman reports that her boyfriend may be part of the terrorist conspiracy. Jack and Curtis find their latest efforts to trap Marwan thwarted by the Secret Service, who have orders to arrest Jack for insubordination. Mike calls on ex-President David Palmer for help as Logan continues to display a lack of leadership.', 'Y', 'N', 8.8),
	('24', '02.00 A.M - 03.00 A.M', 4, 20, 'Yes', 'Yes', 'No', 2, 5, 2005, 'After Logan authorizes Palmer to take charge of the crisis, Palmer sanctions Jack and Curtis to infiltrate the Chinese Embassy on a covert operation to capture a suspect. Tony and Michelle continue to bump into each other\'s personal lives, while Buchanan expresses anger at being kept out of the mission. Jack faces Audrey\'s wrath when a medical dilemma places Paul\'s life in jeopardy.', 'Y', 'N', 9),
	('24', '03.00 A.M - 04.00 A.M', 4, 21, 'Yes', 'Yes', 'No', 9, 5, 2005, 'CTU scrambles to forge an alibi when a Chinese representative produces evidence of American involvement in the raid on their embassy. Audrey gives Jack the cold shoulder, while Palmer and Logan clash over the consequences of Palmer\'s decisions. Jack and Curtis close in on Marwan as the countdown for the missile launch moves ahead.', 'Y', 'N', 8.5),
	('24', '04.00 A.M - 05.00 A.M', 4, 22, 'Yes', 'Yes', 'No', 16, 5, 2005, 'Jack finds that his efforts to bargain with Marwan for the location of the missile strike are futile. Heller pushes his son for information when CTU discovers that he may have had contact with Marwan before the attacks. Logan finds himself in the middle of a power struggle between Palmer and the ambitious Speaker of the House. Tony and Michelle explore their rekindled passion for each other, but their hopes for the future may be short-lived when a familiar player enters the game and takes a hostage.', 'Y', 'N', 8.6),
	('24', '05.00 A.M - 06.00 A.M', 4, 23, 'Yes', 'Yes', 'No', 23, 5, 2005, 'Mandy uses Tony as leverage to try to force Michelle to aid in her escape. A Chinese security operative captures and interrogates one of the CTU agents involved in the raid on the embassy. Palmer and Logan argue over the option of evacuating all major cities that may be targets for the missile.', 'Y', 'N', 9),
	('24', '06.00 A.M - 07.00 A.M', 4, 24, 'Yes', 'Yes', 'No', 23, 5, 2005, 'As the missile speeds toward its destination, Mandy cuts a deal with Jack and the President to give up Marwan\'s location in exchange for a full pardon on all of her crimes. Tony and Michelle share a happy reunion, but Jack finds his relationship with Audrey shattered as she makes her feelings known. Logan\'s advisor suggests a drastic course of action when the Chinese government demands that Jack be handed over to them for trial. Palmer tries desperately to warn Jack of the danger against him. Jack\'s life changes forever as Tony, Michelle and Chloe help him to evade the trap set for him by Secret Service.', 'Y', 'N', 9.1),
	('24', '07.00 A.M - 08.00 A.M', 5, 1, 'Yes', 'Yes', 'No', 15, 1, 2006, '18 months have passed since the events of Day 4. With the exception of David Palmer, Tony Almeida, Michelle Dessler and Chloe O\'Brian, the world believes that Jack Bauer is dead. Jack is living near L.A. under the name of Frank Flynn, working on an oil rig and living with Diane Huxley and her teenage son, Derek. In L.A., David Palmer is visiting his brother Wayne, when he is killed by an assassin\'s bullet. As CTU scrambles to gather more information, an exploding car bomb kills Michelle and injures Tony. Chloe is also pursued by an unknown figure, but she eludes him and manages to contact Jack for help. President Charles Logan and his wife Martha are visiting L.A. and are planning to sign an important arms treaty with the president of Russia. Martha seems to be unstable and is badly shaken by the news of Palmer\'s murder. Logan refuses to heed CTU\'s warnings of possible danger and call off the summit. Jack is forced to take Derek along for the ride as he meets with Chloe and fights off a group of men who want him killed. He forces one of the men to confess that Jack has been deliberately framed for the murders of Palmer and Michelle.', 'Y', 'N', 9.2),
	('24', '08.00 A.M - 09.00 A.M', 5, 2, 'Yes', 'Yes', 'No', 15, 1, 2006, 'Jack and Chloe infiltrate Wayne Palmer\'s penthouse where David Palmer was assassinated, in the hopes of finding a clue to his murder. Jack convinces Wayne to cooperate and finds some information in Palmer\'s memoirs that leads him to the airport where the Russian president is about to land. CTU and Secret Service attempt to capture Jack, but they only find Chloe as Jack and Derek slip through their grasp. Martha tries to convince her husband that she received an important phone call from Palmer the night before his death, but a tape of their conversation seems to contradict her claims. Jack goes to the airport to find a lead, but a group of renegade Russian terrorists take hostages, including Derek, before he can act.', 'Y', 'N', 8.9),
	('24', '09.00 A.M - 10.00 A.M', 5, 3, 'Yes', 'Yes', 'No', 16, 1, 2006, 'Jack conceals himself inside the airport hanger and surveys the Russian separatists, feeding information to Curtis and his assault team. The terrorists begin executing hostages in an attempt to make Logan cave into their demands. Martha discovers that all traces of her conversation with Palmer may not have been erased.', 'Y', 'N', 8.8),
	('24', '10.00 A.M - 11.00 A.M', 5, 4, 'Yes', 'Yes', 'No', 16, 1, 2006, 'Jack is captured by the terrorists, who use Derek as leverage to force him to compromise CTU\'s assault operation. ', 'Y', 'N', 8.8),
	('24', '11.00 A.M - 12.00 P.M', 5, 5, 'Yes', 'Yes', 'No', 23, 1, 2006, 'Jack returns to CTU and has an emotional reunion with Audrey, while Curtis tracks the Russians and the stolen nerve gas. Walt sends in a hit man to silence Jack. Chloe discovers that Spencer has his own agenda at CTU. Walt convinces Logan to have Martha institutionalized when she tells them of the attack on her.', 'Y', 'N', 8.8),
	('24', '12.00 P.M - 01.00 P.M', 5, 6, 'Yes', 'Yes', 'No', 30, 1, 2006, 'Jack contacts Mike and asks for a secret meeting in hopes of gathering evidence against Walt. Martha begs Aaron for help, while a desperate Walt tries to force Logan to aid him in his complicity with the terrorists. Buchanan butts heads with Lynn over a decision to violate the president\'s orders, while the Russians attempt to escape with the nerve gas.', 'Y', 'N', 8.8),
	('24', '01.00 P.M - 02.00 P.M', 5, 7, 'Yes', 'Yes', 'No', 6, 2, 2006, 'Jack tracks down a man who has a connection to the terrorists. Logan is forced to grant him immunity in exchange for information on their whereabouts. Mike and Martha argue over Logan\'s public response to Walt\'s involvement with the Russians. Lynn is drawn away from his post by a personal crisis as the terrorists come closer to striking against the U.S.', 'Y', 'N', 8.4),
	('24', '02.00 P.M - 03.00 P.M', 5, 8, 'Yes', 'Yes', 'No', 13, 2, 2006, 'Jack poses as Rossler and manages to trace one of the canisters of nerve gas, but he goes against orders from the president when the terrorists target a shopping mall. Logan and Martha quarrel when she learns of her husband\'s intention to cover up the real reason for Walt\'s suicide.', 'Y', 'N', 8.5),
	('24', '03.00 P.M - 04.00 P.M', 5, 9, 'Yes', 'Yes', 'No', 20, 2, 2006, 'Lynn orders Curtis to take Jack into custody for violating presidential orders, but Jack breaks away from Curtis when Nathanson contacts him through Audrey and offers information on the location of the nerve gas. Lynn begins to unleash on his coworkers as he discovers that they may be working against him to aid Jack. The head of the terrorists makes a demand on Logan, and Martha takes a dangerous step to get her husband\'s attention.', 'Y', 'N', 8.5),
	('24', '04.00 P.M - 05.00 P.M', 5, 10, 'Yes', 'Yes', 'No', 27, 2, 2006, 'Logan wrestles with his conscience when he learns that Martha is riding in the motorcade with the Suvarovs. Audrey convinces Curtis to take action as Lynn continues to abuse his authority. Jack learns that an ex CTU agent, Christopher Henderson, works for a company which is connected with the nerve gas.', 'Y', 'N', 8.9),
	('24', '05.00 P.M - 06.00 P.M', 5, 11, 'Yes', 'Yes', 'No', 6, 3, 2006, 'Jack interrogates Henderson\'s wife about her husband\'s connection to the terrorists. Lynn begs his sister to return his stolen keycard, while Tony regains consciousness and learns of Michelle\'s fate. Martha gives Logan the cold shoulder, while Curtis tracks another nerve gas attack to a local hospital.', 'Y', 'N', 8.6),
	('24', '06.00 P.M - 07.00 P.M', 5, 12, 'Yes', 'Yes', 'No', 6, 3, 2006, 'Jack takes Henderson to CTU for questioning. Once there, he faces an unhappy reunion with his daughter, Kim. Mike appeals to Martha for help as Logan faces pressure from his Vice-President to declare martial law on L.A. Lynn connects the theft of his keycard to an impending strike on CTU, but his warning comes too late to stop a terrorist from infiltrating the building.', 'Y', 'N', 9.2),
	('24', '07.00 P.M - 08.00 P.M', 5, 13, 'Yes', 'Yes', 'No', 13, 3, 2006, 'Jack and Lynn must take action when they discover that the nerve gas is breaking through the protective seals that are keeping the CTU survivors alive. Chloe wrestles with her grief over Edgar\'s death, while Tony contemplates revenge against Henderson. Martha bolster\'s Logan\'s spirit as he wavers under more political pressure from Gardner.', 'Y', 'N', 8.9),
	('24', '08.00 P.M - 09.00 P.M', 5, 14, 'Yes', 'Yes', 'No', 20, 3, 2006, 'Jack bargains with a German intelligence agent in order to find the woman who can lead him to Bierko. Buchanan chafes against the new chain of command as Homeland Security prepares to take over CTU operations. Aaron receives a request for a secret meeting from Wayne Palmer, as Logan implements martial law in L.A.', 'Y', 'N', 8.6),
	('24', '09.00 P.M - 10.00 P.M', 5, 15, 'Yes', 'Yes', 'No', 27, 3, 2006, 'Jack pushes Audrey for answers when evidence indicates that she may be involved with the terrorists. Wayne and Aaron flee from a group of gunmen who have orders from Henderson to kill them. Bierko and his men gain access to a natural gas plant, where they plan to distribute the nerve gas throughout L.A.', 'Y', 'N', 8.8),
	('24', '10.00 P.M - 11.00 P.M', 5, 16, 'Yes', 'Yes', 'No', 3, 4, 2006, 'Jack and Wayne locate a source inside Logan\'s administration who has information on Palmer\'s assassination. But things get complicated when they learn that Henderson is using leverage to keep her silent. Audrey is forced to choose between Chloe and Buchanan as Homeland Security begins to absorb CTU.', 'Y', 'N', 8.7),
	('24', '11.00 P.M - 12.00 A.M', 5, 17, 'Yes', 'Yes', 'No', 10, 4, 2006, 'Jack and Wayne locate a recording that definitively proves Logan\'s involvement in the terrorist conspiracy, but Henderson corners them in the hopes of destroying the incriminating tape. Logan tries to cover his tracks by issuing a warrant for Jack\'s arrest. Audrey contacts her father for help, while Chloe gives her cover while helping Jack evade CTU.', 'Y', 'N', 8.6),
	('24', '12.00 A.M - 01.00 A.M', 5, 18, 'Yes', 'Yes', 'No', 17, 4, 2006, 'Jack shows Heller the incriminating recording in the hopes that he will help them take down Logan, but Heller has plans of his own that will save face for the presidency. Miles tricks Chloe into leading CTU to Jack and Audrey. Mike and Martha both become more suspicious of Logan\'s actions, while Heller confronts the president with an ultimatum.', 'Y', 'N', 8.6),
	('24', '01.00 A.M - 02.00 A.M', 5, 19, 'Yes', 'Yes', 'No', 24, 4, 2006, 'Jack captures Henderson and attempts to force him to hand over the recording, but Henderson targets Heller to buy himself more time. Logan confesses his involvement in Palmer\'s assassination to a distraught Martha. Miles traces Chloe to Buchanan\'s home, but Hayes finds herself questioning Logan\'s motives as CTU closes in.', 'Y', 'N', 8.6),
	('24', '02.00 A.M - 03.00 A.M', 5, 20, 'Yes', 'Yes', 'No', 1, 5, 2006, 'After stowing away aboard the flight containing Henderson\'s contact and the incriminating recording, Jack finds himself having to deal with a pilot who refuses to cooperate. Martha begins to break down, and Mike becomes suspicious of what she is hiding from him, while Logan tries to calm his financial backers.', 'Y', 'N', 8.7),
	('24', '03.00 A.M - 04.00 A.M', 5, 21, 'Yes', 'Yes', 'No', 8, 5, 2006, 'Jack searches for a safe place to land the plane when Logan gives orders to shoot it down. Hayes readies Bierko for a transfer to a secure facility, while Audrey receives some good news about her father. Logan becomes desperate as his plans start to unravel, but an unexpected ally at CTU turns the tables in his favor.', 'Y', 'N', 8.6),
	('24', '04.00 A.M - 05.00 A.M', 5, 22, 'Yes', 'Yes', 'No', 15, 5, 2006, 'Bierko escapes from the transport taking him to Division and uses his last canister of nerve gas for a surprise strike. Jack is forced to work with Henderson to find Bierko, but Henderson wants something in return. Logan takes drastic steps to deal with Aaron when he won\'t go along with the cover-up.', 'Y', 'N', 8.4),
	('24', '05.00 A.M - 06.00 A.M', 5, 23, 'Yes', 'Yes', 'No', 22, 5, 2006, 'Jack and Henderson wage an assault on the submarine as Bierko prepares to launch an attack against L.A. Chloe brings in someone from her past to aid her. Martha and Aaron enlist Mike\'s help in their plans to expose Logan.', 'Y', 'N', 8.8),
	('24', '06.00 A.M - 07.00 A.M', 5, 24, 'Yes', 'Yes', 'No', 22, 5, 2006, 'Jack takes his fight directly to the President as he attempts to force a confession from him that will prove his involvement in the day\'s events. Martha vents her hatred for her husband in front of the press as Logan gives a eulogy over Palmer\'s body. Jack and Audrey share a tender moment when it seems the crisis has subsided, but Jack finds that his problems have only begun as his past catches up with him.', 'Y', 'N', 9.2),
	('24', '06.00 A.M - 07.00 A.M', 6, 1, 'Yes', 'Yes', 'No', 14, 1, 2007, '20 months have passed since the events of Day Five. For the past 11 weeks, the U.S. has been under siege by a series of terrorist bombings, with Muslim extremists as the prime suspects. L.A. joins the list of casualties when a bus is bombed in a suicide attack. President Wayne Palmer is torn when he receives conflicting advice from his top advisors. Tom Lennox suggests that the government begin rounding up all Islamic-Americans for detention, but NSA Director Karen Hayes argues that it\'s too drastic a step in finding the terrorists.CTU Director Bill Buchanan and Curtis Manning meet with Chinese diplomats, who have agreed to release Jack Bauer from custody. Jack is ragged and dirty and hasn\'t spoken for 20 months. Bill informs him that they\'ve been contacted by a terrorist, Abu Fayed, who can lead them to the man behind the attacks, but he wants to take revenge on Jack for the murder of his brother in return. Jack meagerly accepts his fate, relieved that his death will have meaning.An average family comes to the aid of an Islamic boy when his father is arrested by the FBI, but it soon becomes clear that the boy may be more involved with the terrorists than they realize. Chloe and Morris O\'Brian attempt to intervene on Jack\'s behalf, but their efforts may jeopardize the deal between CTU and Fayed. Jack is turned over to Fayed. Fayed begins to torture Jack, but Jack finds the will to fight for his life when he learns that his death may be in vain.', 'Y', 'N', 8.6),
	('24', '07.00 A.M - 08.00 A.M', 6, 2, 'Yes', 'Yes', 'No', 14, 1, 2007, 'Jack tries to locate Assad in hopes of warning him about the impending air strike. Assad agrees to help Jack locate Fayed, but Jack worries that he\'s forgotten how to do his job. Ahmed finds he must take drastic action when his role in the attacks is discovered. President Palmer\'s sister, Sandra, goes a long way to defend her principles when she finds herself and her civil rights organization to be a target in an FBI investigation.', 'Y', 'N', 8.5),
	('24', '08.00 A.M - 09.00 A.M', 6, 3, 'Yes', 'Yes', 'No', 15, 1, 2007, 'Assad uses clever tactics to manipulate Fayed\'s agent into leading them to the place where Fayed may be hiding. Ahmed uses Ray\'s family as leverage to force him to deliver a mysterious package. Fayed contacts Wayne with a demand, while Sandra bucks the FBI\'s authority. Jack becomes concerned when Curtis begins to display hostility toward Assad.', 'Y', 'N', 8.3),
	('24', '09.00 A.M - 10.00 A.M', 6, 4, 'Yes', 'Yes', 'No', 15, 1, 2007, 'Ray uses the component to bargain for his family\'s freedom, but Ahmed only grants half his wish. Chloe moderates an argument between Morris and Milo, while Walid overhears information in the detention center that may be of use to CTU. Wayne agrees to pardon Assad in the face of his efforts to aid Jack; a gesture that does not sit well with an enraged Curtis. Jack follows a lead given to the police by Jillian, but his information comes too late to stop Fayed from launching another deadly strike.', 'Y', 'N', 9.1),
	('24', '10.00 A.M - 11.00 A.M', 6, 5, 'Yes', 'Yes', 'No', 22, 1, 2007, 'Wayne prepares to talk to the nation as L.A. deals with the fall-out from the nuclear blast. Fayed tries to set up a deal with a new trigger man who can help with the four remaining bombs. Sandra is outraged when the FBI forces Walid to wear a wire in the hopes of gaining information from his fellow inmates. Assad provides CTU with a lead, but Jack finds that it takes a personal twist when he learns that the terrorists may have connections to his estranged family.', 'Y', 'N', 8.3),
	('24', '11.00 A.M - 12.00 P.M', 6, 6, 'Yes', 'Yes', 'No', 29, 1, 2007, 'Jack forces Graem to take him to McCarthy\'s office in the hopes of finding a lead to their father\'s whereabouts. Lennox plays a trump card that removes Karen from his path as he prepares to implement more extreme policies. The FBI\'s sting operation with Walid goes terribly awry, while Nadia finds herself impeded by new security measures at CTU.', 'Y', 'N', 8.1),
	('24', '12.00 P.M - 01.00 P.M', 6, 7, 'Yes', 'Yes', 'No', 5, 2, 2007, 'Jack\'s family loyalties are put to the test as Graem reveals his full involvement in the terrorist activities. Wayne convenes a meeting of his cabinet to discuss Lennox\'s drastic policies, while Sandra tends to an injured Walid. Morris receives some bad news about a relative, and McCarthy sets a trap designed to capture the man who can help Fayed build a new trigger for the nukes.', 'Y', 'N', 8.3),
	('24', '01.00 P.M - 02.00 P.M', 6, 8, 'Yes', 'Yes', 'No', 12, 2, 2007, 'Jack tries to trace Morris\'s location, while Fayed uses harsh tactics to gain his cooperation. Lennox contemplates his resignation in the face of Wayne\'s rebuke, but Reed suggests an extreme course of action that may result in a change in leadership. Wayne meets with Assad and pressures him to publicly renounce terrorism.', 'Y', 'N', 8.3),
	('24', '02.00 P.M - 03.00 P.M', 6, 9, 'Yes', 'Yes', 'No', 12, 2, 2007, 'Marilyn gives Jack a lead that will help him find Gredenko, but they hit a wall as Phillip takes steps to cover his tracks. As Lennox learns more about Reed\'s plan, the Vice-President pushes Wayne to reconsider his dialogue with Assad.', 'Y', 'N', 8.2),
	('24', '03.00 P.M - 04.00 P.M', 6, 10, 'Yes', 'Yes', 'No', 19, 2, 2007, 'Marilyn tells Jack the truth about his father\'s involvement in the day\'s conspiracy. Jack uses her in an attempt to get to Phillip. Chloe covers for Morris when he turns to an old vice after reaching the breaking point, while Milo finds himself over his head in fieldwork. Lennox takes a hard stand as Reed\'s deadly plan to shift presidential control moves forward.', 'Y', 'N', 8.3),
	('24', '04.00 P.M - 05.00 P.M', 6, 11, 'Yes', 'Yes', 'No', 26, 2, 2007, 'Lennox tries desperately to escape from Reed as Wayne makes final preparations for his joint speech with Assad. Chloe continues to cover for Morris as Nadia becomes more suspicious. Jack meets with ex President Logan and learns that a lead to Gredenko\'s whereabouts may be located within the Russian consolate.', 'Y', 'N', 8.1),
	('24', '05.00 P.M - 06.00 P.M', 6, 12, 'Yes', 'Yes', 'No', 5, 3, 2007, 'Vice-President Daniels assumes office in the wake of Wayne\'s injury and makes plans to implement his extreme security agenda. Lennox names the co-conspirators in the attack, but finds himself under Daniels\' thumb. Meanwhile, Karen moves to insert herself back in her former job. Jack and Logan pay a visit to the Russian consulate, but Jack takes drastic action when Logan fails to learn Gredenko\'s location.', 'Y', 'N', 8.2),
	('24', '06.00 P.M - 07.00 P.M', 6, 13, 'Yes', 'Yes', 'No', 12, 3, 2007, 'While Jack evades Russian security guards, Buchanan assigns a new agent, Mike Doyle, to raid the Russian consulate to capture Markov and rescue Jack.Logan calls on his estranged ex-wife in the hopes that she can help to defuse the brewing crisis between the U.S. and Russia.Gredenko prepares to strike at another target. Meanwhile, Daniels gives a Middle Eastern ambassador a strong ultimatum in order to gain his cooperation in the hunt for the remaining nukes.', 'Y', 'N', 8.3),
	('24', '07.00 P.M - 08.00 P.M', 6, 14, 'Yes', 'Yes', 'No', 19, 3, 2007, 'Jack learns a devastating piece of news about Audrey upon his return to CTU.As a desperate Gredenko launches his strike, CTU learns that their systems have been compromised by a mole who is obstructing their efforts to find the drone.Karen finds a possible ally in Lennox as Daniels proceeds on his extreme course that will pit the U.S. against the Middle East.', 'Y', 'N', 8.1),
	('24', '08.00 P.M - 09.00 P.M', 6, 15, 'Yes', 'Yes', 'No', 26, 3, 2007, 'Jack and Doyle head up field ops while tracking Gredenko and Fayed, and the Vice President\'s decision sends shockwaves through his administration.', 'Y', 'N', 8.2),
	('24', '09.00 P.M - 10.00 P.M', 6, 16, 'Yes', 'Yes', 'No', 2, 4, 2007, 'Wayne risks his unstable health in order to fight Daniels for the presidency. Lennox and Karen call an uneasy truce in the face of the impending war. Doyle coerces Nadia into helping him dig up dirt on Milo, while Jack uses Gredenko in a sting operation that will lead them to Fayed.', 'Y', 'N', 8.3),
	('24', '10.00 P.M - 11.00 P.M', 6, 17, 'Yes', 'Yes', 'No', 9, 4, 2007, 'Wayne continues to risk his health as he takes a stand that will force cooperation from the Middle East.Jack realizes he won\'t be able to break Fayed, so he and Doyle concoct a scheme to force Fayed to lead them to the location of the remaining nukes. But Fayed\'s ally engages in trickery that places the plan in jeopardy.', 'Y', 'N', 9),
	('24', '11.00 P.M - 12.00 A.M', 6, 18, 'Yes', 'Yes', 'No', 16, 4, 2007, 'Cheng offers to exchange the nuclear component for Audrey\'s life. Jack gains Chloe\'s covert cooperation, but their plans are dashed when Morris stumbles on to the operation.Wayne gives Daniels an unpleasant ultimatum, but his fragile health soon tips the balance in the vice-president\'s favor.', 'Y', 'N', 8.1),
	('24', '12.00 A.M - 01.00 A.M', 6, 19, 'Yes', 'Yes', 'No', 23, 4, 2007, 'Jack sets up a meeting with Cheng, while Doyle tries to track him with CTU\'s help.Buchanan\'s career is placed in jeopardy when Karen is forced to make a damning choice to save the administration.Daniels seeks comfort from his assistant as he assumes the presidency.', 'Y', 'N', 8),
	('24', '01.00 A.M - 02.00 A.M', 6, 20, 'Yes', 'Yes', 'No', 30, 4, 2007, 'Nadia approves an interrogation technique that might prove fatal to Audrey. Doyle covertly aids Jack in the hopes that he can save her from further mental trauma.Daniels discovers that he may have a leak in his administration when he is confronted by the angry Russian president.Chloe and Morris\'s relationship hits the rocks, while Heller delivers Jack a stern warning.', 'Y', 'N', 8),
	('24', '02.00 A.M - 03.00 A.M', 6, 21, 'Yes', 'Yes', 'No', 7, 5, 2007, 'Jack is held in custody at CTU, while Cheng prepares to launch a surprise attack.Lennox uses Lisa as a plant to send a false message to the Russians in hopes of defusing a tense situation.Morris\' decision to end his relationship with Chloe begins taking its toll on her as they struggle to maintain professionalism, and Josh shows signs of guilt over the role his father played in the day\'s terrorist attacks.', 'Y', 'N', 8.4),
	('24', '03.00 A.M - 04.00 A.M', 6, 22, 'Yes', 'Yes', 'No', 14, 5, 2007, 'Jack runs a desperate tactic to free the CTU hostages from their captors. He manages to intercept Cheng, who plans to deliver Josh to his grandfather in exchange for the circuit board. Jack is forced to allow Cheng to escape in order to save Josh\'s life.Lennox continues to monitor Lisa as she plants evidence for Mark to deliver to the Russians. The situation takes a nasty turn when all does not go according to plan. Meanwhile, Daniels tries to run a bluff on the Russian president, but finds he\'s playing a bad hand.Nadia finds herself facing a hostile investigation over the security breach, while a decision from Daniels pits Doyle against Jack.', 'Y', 'N', 8.2),
	('24', '04.00 A.M - 05.00 A.M', 6, 23, 'Yes', 'Yes', 'No', 21, 5, 2007, 'Doyle takes Josh to meet Phillip in the hopes of retrieving the circuit board, but his conscience bothers him over the exchange.Karen puts her career on the line when she uses Bill to help break Jack from custody. Jack and Bill track Phillip, but not before he pulls a fast move that reaps serious injury to Doyle.Nadia has a conversation with Milo\'s brother, while Chloe suffers from a mysterious medical problem that strikes her at the wrong moment.', 'Y', 'N', 8.2),
	('24', '05.00 A.M - 06.00 A.M', 6, 24, 'Yes', 'Yes', 'No', 21, 5, 2007, 'CTU discovers where Philip is hiding and Daniels orders an air strike in a desperate move to appease the Russians. Jack and Bill go after Josh alone before the bombers find their target.Lennox persuades Daniels to grant leniency for Bill and Karen. In the wake of the close call, Daniels begins to question his choices as acting president.Chloe gives Morris some surprising news that alters their relationship, while Marilyn is reunited with Josh at CTU.', 'Y', 'N', 8.3),
	('24', '08.00 A.M - 09.00 A.M', 7, 1, 'Yes', 'Yes', 'No', 11, 1, 2009, 'Since Jack Bauer has been pulled from his senate sub-committee hearing to assist with the deadly domestic threat and the investigation of former colleague Tony Almeida, his new undefined role is to help secure the nation. Meanwhile, President Allison Taylor presides over the escalating time-sensitive dilemmas linked to the unrest in Sangala. Chloe O\'Brian and Bill Buchanan are on hand this season as well as FBI Agents Renee Walker, Larry Moss, Janis Gold and Sean Hillinger to cope with the unthinkable events', 'Y', 'N', 8.5),
	('24', '09.00 A.M - 10.00 A.M', 7, 2, 'Yes', 'Yes', 'No', 11, 1, 2009, 'Since Jack Bauer has been pulled from his senate sub-committee hearing to assist with the deadly domestic threat and the investigation of former colleague Tony Almeida, his new undefined role is to help secure the nation. Meanwhile, President Allison Taylor presides over the escalating time-sensitive dilemmas linked to the unrest in Sangala. Chloe O\'Brian and Bill Buchanan are on hand this season as well as FBI Agents Renee Walker, Larry Moss, Janis Gold and Sean Hillinger to cope with the unthinkable events', 'Y', 'N', 8.4),
	('24', '10.00 A.M - 11.00 A.M', 7, 3, 'Yes', 'Yes', 'No', 12, 1, 2009, 'With Tony in custody, Jack leads his interrogation, but is shocked when a code word Tony whispers in his ear leads to old friends and a plot much deeper than anyone in the FBI anticipated. Jack once again takes the law into his own hands when he breaks Tony out of the FBI\'s custody to deliver him back to the terrorist faction. Renee asks FBI technician Janis Gold to try to uncover a possible leak in the agency, but Janis is terrified when her discoveries point to fellow analyst Sean Hillinger. Colonel Dubaku sends a message to President Taylor, insisting that the US withdraw its forces from Sangala or risk a terrible attack on their soil.', 'Y', 'N', 8.9),
	('24', '11.00 A.M - 12.00 P.M', 7, 4, 'Yes', 'Yes', 'No', 12, 1, 2009, 'Buchanan takes Jack to \'CTU\', a secret hideout where he and Chloe had been working with Tony to uncover the conspiracy within the US government. Tony had been undercover with the terrorists aiding Juma to discover the moles. Jack agrees to help get Tony back in play by joining Emerson\'s crew himself. Taylor is forced to meet with Matobo to inform him that she may be required to withdraw her forces from Sangala to protect American lives. Her Chief of Staff Ethan Kanin agrees with this decision, but Taylor is not yet convinced. Henry meets with Samantha, Roger\'s former girlfriend, who tells him that Roger was indeed murdered and provides him with proof.', 'Y', 'N', 8.3),
	('24', '12.00 P.M - 01.00 P.M', 7, 5, 'Yes', 'Yes', 'No', 19, 1, 2009, 'As the threat of terrorism escalates, Jack Bauer is forced to take matters into his own hands to avert the imminent crisis facing the country. Meanwhile, lives are on the line as conflicted Agent Renee Walker copes with the volatile investigation, and FBI honcho Larry Moss is forced to keep a closer eye on his team as the nation\'s security is in jeopardy. At the White House, international stakes are raised and the First Gentleman proceeds with his personal mission.', 'Y', 'N', 8.4),
	('24', '01.00 P.M - 02.00 P.M', 7, 6, 'Yes', 'Yes', 'No', 26, 1, 2009, 'As Dubaku presses President Taylor to comply with his devilish demands, she contemplates if the administration should negotiate to avert a disastrous terror attack. Meanwhile, away from the White House and the threatening international crisis, the determined First Gentleman struggles with his ongoing domestic mission, and perilous FBI Agent Walker diverts the attention of her tense colleagues. With national security on the line, Jack Bauer has a formidable plan in hopes of shielding the country in the Day 7: 1:00-2:00 PM episode.', 'Y', 'N', 8.4),
	('24', '02.00 P.M - 03.00 P.M', 7, 7, 'Yes', 'Yes', 'No', 2, 2, 2009, 'As U.S. troops remain in position outside of Sangala, Dubaku seeks another high-value target using the CIP module. While the entire NSA scrambles to locate the breach, the situation rapidly escalates. Paranoid FBI Agent Janis Gold commands from her post, while Jack, Tony, Renee, Chloe and Buchanan follow leads.', 'Y', 'N', 8.3),
	('24', '03.00 P.M - 04.00 P.M', 7, 8, 'Yes', 'Yes', 'No', 9, 2, 2009, 'As the country reels from the recent terror attacks and faces the mounting global ramifications, the administration refuses to acquiesce and presses on with their disapproval of the Juma regime. As Jack Bauer and team head to the White House for a pivotal meeting with President Taylor, Dubaku raises the stakes when he threatens the First Family', 'Y', 'N', 8.4),
	('24', '04.00 P.M - 05.00 P.M', 7, 9, 'Yes', 'Yes', 'No', 16, 2, 2009, 'After eight hellacious hours of this terrible day have elapsed, the country remains on edge. President Taylor struggles with the painful circumstances facing the First Family, including her daughter Olivia. Meanwhile, a huffy Chloe faces-off against paranoid FBI Agent Janis Gold, while Jack and Agent Walker track leads through Washington, D.C. to eliminate the threat of another ruthless terror attack', 'Y', 'N', 8.3),
	('24', '05.00 P.M - 06.00 P.M', 7, 10, 'Yes', 'Yes', 'No', 23, 2, 2009, 'Jack and Renee Walker pursue Dubaku through the streets of Washington, D.C., with a little cyber help from Chloe. Meanwhile, the first family and the FBI are left reeling from incidents involving turncoat agents.', 'Y', 'N', 8.6),
	('24', '06.00 P.M - 07.00 P.M', 7, 11, 'Yes', 'Yes', 'No', 2, 3, 2009, 'Not even at the halfway point of this hellacious day, two planes have collided outside of D.C., there has been an attempt on a chemical plant in Ohio, the President\'s husband\'s life has been threatened and the nation remains at risk. When Dubaku\'s evil plan escalates to his boss, General Juma, the stakes are raised and steadfast President Taylor faces a deepening foreign policy dilemma.', 'Y', 'N', 8.4),
	('24', '07.00 P.M - 08.00 P.M', 7, 12, 'Yes', 'Yes', 'No', 2, 3, 2009, 'Juma and his men take the White House by storm, killing most of the Secret Service and trapping Taylor and Jack in the saferoom. His efforts to extract her are thwarted until he is informed that the President\'s daughter is in the White House as well. Renee and Larry try to convince Vice President Hayworth to let them rescue the President, but Hayworth will not budge until the FBI can produce proof that she is not in imminent danger.', 'Y', 'N', 9),
	('24', '08.00 P.M - 09.00 P.M', 7, 13, 'Yes', 'Yes', 'No', 9, 3, 2009, 'The siege on the White House reaches an explosive end after Jack and Bill work together to try and save President Taylor. Meanwhile, Jonas Hodges makes moves to cover his own tracks, starting with Ryan Burnett.', 'Y', 'N', 8.8),
	('24', '09.00 P.M - 10.00 P.M', 7, 14, 'Yes', 'Yes', 'No', 16, 3, 2009, 'Malevolent mastermind Jonas Hodges emerges as Jack Bauer\'s latest adversary as the long, terrifying day ticks deeper into the night. Jack yields results from a surprise meeting, and the fight to avert additional terror attacks continues.', 'Y', 'N', 8.6),
	('24', '10.00 P.M - 11.00 P.M', 7, 15, 'Yes', 'Yes', 'No', 23, 3, 2009, 'Olivia Taylor, the President\'s daughter, becomes increasingly involved in the day\'s events, and the administration reels when a high-ranking official delivers devastating news.', 'Y', 'N', 8.4),
	('24', '11.00 P.M - 12.00 A.M', 7, 16, 'Yes', 'Yes', 'No', 30, 3, 2009, 'The game changes for Jack Bauer, and the FBI is forced to collaborate with other federal agencies. As the threat intensifies, the administration shakes things up and seeks a new perspective.', 'Y', 'N', 8.4),
	('24', '12.00 A.M - 01.00 A.M', 7, 17, 'Yes', 'Yes', 'No', 6, 4, 2009, 'As the day stretches into the middle of the night, Jack and the FBI formulate a plan to prevent further terror attacks. Events take an unexpected turn when the politics surrounding the administration expand beyond the White House.', 'Y', 'N', 8.3),
	('24', '01.00 A.M - 02.00 A.M', 7, 18, 'Yes', 'Yes', 'No', 13, 4, 2009, 'Jack Bauer endures the elements and fights on to prevent an attack that could change the country forever. As the catastrophic blow to the nation nears, Tony Almeida operates from the field and Kim Bauer, who was last seen in Season Five, returns. Meanwhile, the stakes are raised when the administration is faced with a blackmail scenario.', 'Y', 'N', 8.7),
	('24', '02.00 A.M - 03.00 A.M', 7, 19, 'Yes', 'Yes', 'No', 20, 4, 2009, 'As the nation remains vulnerable, Jack Bauer endures the worsening pathogen pain. The FBI deals with recent deadly developments while matters involving key players takes this day into a unexpected direction.', 'Y', 'N', 8.4),
	('24', '03.00 A.M - 04.00 A.M', 7, 20, 'Yes', 'Yes', 'No', 27, 4, 2009, 'The nation remains vulnerable as Starkwood mastermind Jonas Hodges remains at the epicenter of the mounting terrorist threat. Meanwhile, the FBI and the administration scramble to provide security and justice, and Jack Bauer questions a key suspect', 'Y', 'N', 8.2),
	('24', '04.00 A.M - 05.00 A.M', 7, 21, 'Yes', 'Yes', 'No', 4, 5, 2009, 'While lives remain on the line, an emotional Chloe copes with the declining conditions. With only a few hours left in Jack Bauer\'s day, the situation worsens when the politicking inside the White House corners the divided administration.', 'Y', 'N', 8),
	('24', '05.00 A.M - 06.00 A.M', 7, 22, 'Yes', 'Yes', 'No', 11, 5, 2009, 'Innocent lives remain in the line of fire as this terrifying day draws to a close. Jack is faced with an unthinkable situation while his perpetually imperiled daughter, Kim , gets involved. Meanwhile, the imminent threat stokes the heated rivalry between Chloe and Janis.', 'Y', 'N', 8.3),
	('24', '06.00 A.M - 07.00 A.M', 7, 23, 'Yes', 'Yes', 'No', 18, 5, 2009, 'Jack Bauer is forced to help Tony escape from custody, only to find Tony plans to use Jack to reconstitute the pathogen. Aaron Pierce and Ethan Kanin work together and discover Olivia\'s role in Hodges\' murder. Kim Bauer takes down her captors, and works with Renee Walker to find her father.', 'Y', 'N', 8.5),
	('24', '07.00 A.M - 08.00 A.M', 7, 24, 'Yes', 'Yes', 'No', 18, 5, 2009, 'Presented with the evidence of Olivia\'s actions, President Allison Taylor is forced to make a decision between her family and the Presidency. Thanks to Kim Bauer, Janis, Renee and Chloe are able to save Jack and arrest Tony before he can kill Alan Wilson. With Wilson refusing to talk and Jack about to die, the fight is no longer in the field, it\'s for the hearts and souls of Jack and Renee.', 'Y', 'N', 8.7),
	('24', '04.00 P.M - 05.00 P.M', 8, 1, 'Yes', 'Yes', 'No', 17, 1, 2010, 'Jack is back, this time in New York City spending time with his granddaughter. However, when a former contact comes to him with vital information on an upcoming terrorist assassination attempt, Jack has no choice but to become involved and take the man to CTU. But to get to CTU, they first need to survive a whole bunch of terrorists all trying to kill them. Meanwhile, Chloe struggles to settle in at her new position at the upgraded CTU, and President Allison Taylor negotiates with Middle Eastern leader Omar Hassan over weapons inspections... unaware that Hassan is the assassins\' target. Also, a journalist named Meredith Reed is suspected to have direct ties with the on-going terrorist crisis.', 'Y', 'N', 8.3),
	('24', '05.00 P.M - 06.00 P.M', 8, 2, 'Yes', 'Yes', 'No', 17, 1, 2010, 'For the first time in New York City, Jack Bauer is reluctantly drawn into action as President Allison Taylor negotiates plans for international security with Middle Eastern leader Omar Hassan. As the 8th day keeps unfolding, we learn that CTU, now upgraded and operated by M.B.A.-schooled Brian Hastings, still has Chloe O\'Brian, but also expert analyst Dana Walsh and systems analyst Arlo Glass.', 'Y', 'N', 8.1),
	('24', '06.00 P.M - 07.00 P.M', 8, 3, 'Yes', 'Yes', 'No', 18, 1, 2010, 'Jack Bauer becomes further involved in preventing an assassination attempt on visiting president Omar Hassan. As the crisis continues to escalate, the crew at the newly upgraded CTU is challenged by some unexpected complicated circumstances. Meanwhile, tensions run high when an explosive event jeopardizes international security.', 'Y', 'N', 8.4),
	('24', '07.00 P.M - 08.00 P.M', 8, 4, 'Yes', 'Yes', 'No', 18, 1, 2010, 'While the newly-upgraded CTU is challenged by some unexpected and complicated circumstances, Jack Bauer becomes even more involved in preventing an upcoming assassination attempt on Omar Hassan, a visiting President. Meanwhile, international security is jeopardized by an explosive event, and Jack is reunited with agent Renee Walker.', 'Y', 'N', 8.3),
	('24', '08.00 P.M - 09.00 P.M', 8, 5, 'Yes', 'Yes', 'No', 25, 1, 2010, 'Four explosive hours after being unwillingly drawn back into action, Jack Bauer reteams with a risky Renee Walker to track some very dangerous leads. Meanwhile, back at CTU, a desperate Dana Walsh faces tense and untimely circumstances, and emotions escalate when President Taylor learns of a larger looming threat that jeopardizes the peace accord with President Hassan.', 'Y', 'N', 8.1),
	('24', '09.00 P.M - 10.00 P.M', 8, 6, 'Yes', 'Yes', 'No', 1, 2, 2010, 'Undercover Agent Renee Walker confronts her painful past when attempting to broker a deal with a ruthless, but very well-connected German arms dealer. When CTU shifts its focus from the perilous circumstances surrounding Jack and Renee, lead analyst Dana Walsh comes up with a plan to quell her situation and Chloe O\'Brian puts Arlo Glass in his place. As Jack and Renee\'s undercover mission takes unexpected turns, the Hassan family turmoil has President Taylor reeling as the peace agreement is jeopardized.', 'Y', 'N', 8.1),
	('24', '10.00 P.M - 11.00 P.M', 8, 7, 'Yes', 'Yes', 'No', 8, 2, 2010, 'Despite averting the assassination attempt on foreign peacekeeping leader Omar Hassan, Jack Bauer\'s day intensifies when he is forced to go further undercover to secure the unsecured enriched nuclear materials. As international delegates reconvene at the United Nations, President Taylor\'s goodwill comes into question and CTU races against time to assist with the mission.', 'Y', 'N', 8.2),
	('24', '11.00 P.M - 12.00 A.M', 8, 8, 'Yes', 'Yes', 'No', 15, 2, 2010, 'President Taylor pressures CTU for progress while Jack\'s perilous plan has operatives panicked. As the scope of the looming threat expands, the dynamic at CTU changes and the ongoing crisis worsens.', 'Y', 'N', 8.2),
	('24', '12.00 A.M - 01.00 A.M', 8, 9, 'Yes', 'Yes', 'No', 22, 2, 2010, 'As Jack\'s day enters the early morning hours, the nation remains vulnerable, and President Taylor presses on with her international peace process. With the possibility of colossal failure facing CTU, attention turns to who is to blame, and things get personal when operatives take matters into their own hands.', 'Y', 'N', 7.9),
	('24', '01.00 A.M - 02.00 A.M', 8, 10, 'Yes', 'Yes', 'No', 1, 3, 2010, 'As the terror threat continues, the Hassan family turmoil fans the flames of the increasingly urgent situation. When Jack closes in on a person of significant interest, a tense meeting between President Taylor and Omar Hassan takes an unexpected turn as the global security stakes are raised.', 'Y', 'N', 8),
	('24', '02.00 A.M - 03.00 A.M', 8, 11, 'Yes', 'Yes', 'No', 8, 3, 2010, 'The clock races into the middle of the night when the threat of a devastating nuclear attack accelerates as Jack tracks an informed terror suspect who has an explosive strategy. Back at CTU, a key player grapples with being demoted, and the day takes an unexpected stressful turn when pesky parole officer Bill Prady enters the picture.', 'Y', 'N', 8.2),
	('24', '03.00 A.M - 04.00 A.M', 8, 12, 'Yes', 'Yes', 'No', 14, 3, 2010, 'While Jack and Cole team up in the field to shield New York from the calamitous threat, a hostage situation has CTU completely stressed out. Meanwhile, unrelenting parole officer Prady presses on in his investigation, and unexpected developments send the Hassan family into a major tailspin.', 'Y', 'N', 8.6),
	('24', '04.00 A.M - 05.00 A.M', 8, 13, 'Yes', 'Yes', 'No', 22, 3, 2010, 'As the imminent terror threat nears and CTU copes with the day\'s explosive events, the onerous NSA intervenes. Conditions at CTU remain tenuous and field operatives find intense action when Jack Bauer leads them on a risky mission. Meanwhile, Chloe and Dana make game-changing moves.', 'Y', 'N', 8.2),
	('24', '05.00 A.M - 06.00 A.M', 8, 14, 'Yes', 'Yes', 'No', 29, 3, 2010, 'President Taylor\'s vision of global peace has been foiled over the last 13 hellish hours, and the situation worsens when the imminent threat of mass destruction clarifies. As her idealistic nature becomes a point of contention, she tasks Jack Bauer with a crucial mission, and advisor Ethan Kanin returns in the heart-stopping.', 'Y', 'N', 8.3),
	('24', '06.00 A.M - 07.00 A.M', 8, 15, 'Yes', 'Yes', 'No', 5, 4, 2010, 'As dawn breaks over New York, President Taylor endures a game-changing setback as the threat of mass destruction looms. Meanwhile, President Hassan makes a shocking decision that surprises his loved ones. But before long, trusted confidantes will become enemies of the state, and it\'s only the beginning of the betrayals that are to come as the race against time ticks over two pulse-pounding hours.', 'Y', 'N', 8.6),
	('24', '07.00 A.M - 08.00 A.M', 8, 16, 'Yes', 'Yes', 'No', 5, 4, 2010, 'President Taylor undergoes a game-changing setback. President Hassan makes a decision that shocks his loved ones, trusted confidantes become enemies of the state.', 'Y', 'N', 9),
	('24', '08.00 A.M - 09.00 A.M', 8, 17, 'Yes', 'Yes', 'No', 12, 4, 2010, 'As the country reels from the day\'s devastating events, stalwart President Taylor attempts to resuscitate the peace agreement, the cornerstone of her administration. Much to her dismay, she is forced to solicit the services of disgraced former President Logan. Meanwhile, Jack Bauer makes an unprecedented emotional move that triggers the unthinkable, and back at CTU, Chloe is charged with new responsibilities.', 'Y', 'N', 8.8),
	('24', '09.00 A.M - 10.00 A.M', 8, 18, 'Yes', 'Yes', 'No', 19, 4, 2010, 'With only seven hours left in the series\' final harrowing day, Jack Bauer sets out to avenge the tragic life-changing events that he has endured. As things become even more personal for Jack, he heads to CTU for an intense meeting after learning of a devastating development. Meanwhile, on the verge of achieving peace on a scale that has eluded the world for generations, President Taylor becomes deeply conflicted when former President Logan sits down at the bargaining table.', 'Y', 'N', 8.4),
	('24', '10.00 A.M - 11.00 A.M', 8, 19, 'Yes', 'Yes', 'No', 26, 4, 2010, 'With only six hours left, the clock races toward the series finale as President Allison Taylor faces impossible choices and much to the dismay of CTU, she enlists a private security firm to complete a sensitive task led by Mark Bledsoe. Meanwhile, Jack calls in a favor to his old friend Rick Vickers before he embarks upon a crucial mission of his own.', 'Y', 'N', 8.2),
	('24', '11.00 A.M - 12.00 P.M', 8, 20, 'Yes', 'Yes', 'No', 3, 5, 2010, 'With only five hours left, the clock races toward the climactic series finale as Jack stops at absolutely nothing to avenge the emotional setback of losing his beloved partner Renee Walker. Meanwhile, the administration attempts to keep the historic and pivotal peace agreement on track as undermining forces surface.', 'Y', 'N', 8.6),
	('24', '12.00 P.M - 01.00 P.M', 8, 21, 'Yes', 'Yes', 'No', 10, 5, 2010, 'With only four hours left, a rogue Jack Bauer stops at nothing to determine who is behind the day\'s most devastating events, and he uncovers an unexpected lead.', 'Y', 'N', 8.9),
	('24', '01.00 P.M - 02.00 P.M', 8, 22, 'Yes', 'Yes', 'No', 17, 5, 2010, 'As the clock ticks toward the climactic series finale, three hours remain and a ruthless Jack Bauer is on an unwavering mission to uncover the truth, which only complicates circumstances for President Taylor as she prepares for a signing ceremony. Meanwhile, President Logan comes face-to-face with a formidable foe, and Chloe leads CTU on a high-stakes collision course with Jack Bauer.', 'Y', 'N', 9.1),
	('24', '02.00 P.M - 03.00 P.M', 8, 23, 'Yes', 'Yes', 'No', 24, 5, 2010, 'Emotions run high as the harrowing day climaxes with resolute President Taylor closing in on a world-changing peace treaty and a vengeful Jack Bauer taking matters into his own hands for one last and unforgettable job.', 'Y', 'N', 9),
	('24', '03.00 P.M - 04.00 P.M', 8, 24, 'Yes', 'Yes', 'No', 24, 5, 2010, 'Emotions run high as the harrowing day climaxes with resolute President Taylor closing in on a world-changing peace treaty and a vengeful Jack Bauer taking matters into his own hands for one last and unforgettable job.', 'Y', 'N', 9.1),
	('24', '11.00 A.M - 12.00 P.M', 9, 1, 'Yes', 'Yes', 'No', 5, 5, 2014, 'After four years off the grid, Jack is apprehended in London by the CIA  on the very day that President James Heller arrives. As the President faces political pressure over a US drone program run from a UK-based base, only disgraced agent Kate Morgan suspects that Jack\'s capture was all too easy.', 'Y', 'N', 8.9),
	('24', '12.00 P.M - 01.00 P.M', 9, 2, 'Yes', 'Yes', 'No', 5, 5, 2014, 'Jack and Chloe are on the trail of a hacker who might lead them to whoever is behind an assassination attempt on President Heller... but Kate is hot on Jack\'s trail.', 'Y', 'N', 8.8),
	('24', '01.00 P.M - 02.00 P.M', 9, 3, 'Yes', 'Yes', 'No', 12, 5, 2014, 'As the hunt continues for Jack Bauer, the terror threat is intensifying, much to the chagrin of the CIA and Kate Morgan. Across town, President James Heller prepares to address Parliament in an attempt to heal recent wounds with the British, and to preserve his legacy. Meanwhile, Margot - a homegrown British terrorist seeking to avenge her husband\'s death - proves she is willing to make any sacrifice for her mission.', 'Y', 'N', 8.5),
	('24', '02.00 P.M - 03.00 P.M', 9, 4, 'Yes', 'Yes', 'No', 19, 5, 2014, 'The terror threat escalates as Jack heads for the U.S. Embassy with the CIA closing in on him. Meanwhile, Margot asserts her authority with unthinkable force; President Heller makes an impassioned speech to Parliament; and Kate takes matters into her own hands.', 'Y', 'N', 8.8),
	('24', '03.00 P.M - 04.00 P.M', 9, 5, 'Yes', 'Yes', 'No', 26, 5, 2014, 'An unlikely duo joins forces to forestall an impending attack. The terrorist reveals her demands. The President orders a military lockdown, but it may be too late.', 'Y', 'N', 8.7),
	('24', '04.00 P.M - 05.00 P.M', 9, 6, 'Yes', 'Yes', 'No', 2, 6, 2014, 'As the smoke clears after the devastating events of the first five hours, tensions between President Heller and Prime Minister Davies boil over, and one of them decides to take matters into his own hands. In the meantime, Jack proposes a plan to locate Margot by using someone unexpected as his unsuspecting bait. Back at the CIA in London, Jordan raises suspicions about Kate\'s husband.', 'Y', 'N', 8.8),
	('24', '05.00 P.M - 06.00 P.M', 9, 7, 'Yes', 'Yes', 'No', 9, 6, 2014, 'Following an intense and deadly shootout, Jack and Kate are in a race against time to save the life of a key player tied to the imminent terror threat. Meanwhile, Jordan Reed is ordered into the field on a perilous mission. Then, after President Heller engages Margot to end her savage attacks, he faces an unthinkable, game-changing decision.', 'Y', 'N', 8.8),
	('24', '06.00 P.M - 07.00 P.M', 9, 8, 'Yes', 'Yes', 'No', 16, 6, 2014, 'Jack Bauer and President Heller endure the unthinkable to thwart the terror attacks of mastermind Margot Al-Harazi. Meanwhile, CIA agent Jordan Reed faces a life-or-death struggle and Kate takes drastic measures to track down Margot before it\'s too late.', 'Y', 'N', 9.1),
	('24', '07.00 P.M - 08.00 P.M', 9, 9, 'Yes', 'Yes', 'No', 23, 6, 2014, 'True colors are revealed in the midst of some very intense circumstances. Meanwhile, Jack and Chloe launch a plan to eliminate the terrorist threat and keep London safe from any more attacks, but to do so first he and Kate need to track down some crucial leads with little time to spare. ', 'Y', 'N', 9.1),
	('24', '08.00 P.M - 09.00 P.M', 9, 10, 'Yes', 'Yes', 'No', 30, 6, 2014, 'Jack Bauer\'s harrowing day crescendos as he pursues final leads at all costs. The emotional toll of the day\'s events escalates when Kate Morgan learns the truth about her husband and Audrey confronts Boudreau about his duplicity. Making matters incredibly worse, the scope of the terror threat widens and the potential devastation reaches new heights.', 'Y', 'N', 9.1),
	('24', '09.00 P.M - 10.00 P.M', 9, 11, 'Yes', 'Yes', 'No', 7, 7, 2014, 'As the smoke clears after the devastating events of the first five hours, tensions between President Heller and Prime Minister Davies boil over, and one of them decides to take matters into his own hands. In the meantime, Jack proposes a plan to locate Margot by using someone unexpected as his unsuspecting bait. Back at the CIA in London, Jordan raises suspicions about Kate\'s husband.', 'Y', 'N', 8.9),
	('24', '10.00 P.M - 11.00 P.M', 9, 12, 'Yes', 'Yes', 'No', 14, 7, 2014, 'Following an intense and deadly shootout, Jack and Kate are in a race against time to save the life of a key player tied to the imminent terror threat. Meanwhile, Jordan Reed is ordered into the field on a perilous mission. Then, after President Heller engages Margot to end her savage attacks, he faces an unthinkable, game-changing decision.', 'Y', 'N', 9.3),
	('And Then There Were None', 'Episode 1', 1, 1, 'Yes', 'Yes', 'No', 26, 12, 2015, '1939. As civilization teeters on the brink of war, ten strangers are persuaded to retreat from their troubled lives to Soldier Island, an isolated rock off the Devon coast.', 'N', 'N', 8.4),
	('And Then There Were None', 'Episode 2', 1, 2, 'Yes', 'Yes', 'No', 27, 12, 2015, 'As the sun rises and sets on the island and its solitary mansion, the number of guests is whittled down by their invisible enemy  to seven, to six, to five', 'N', 'N', 8.6),
	('And Then There Were None', 'Episode 3', 1, 3, 'Yes', 'Yes', 'No', 28, 12, 2015, 'Cut down to half their original number, the guests of Soldier Island are in danger of losing their minds to fear and anxiety.', 'N', 'N', 8.7),
	('Arrow', 'Pilot', 1, 1, 'Yes', 'Yes', 'Yes', 10, 10, 2012, 'After a violent shipwreck, billionaire playboy Oliver Queen was missing and presumed dead for five years before being discovered alive on a remote island in the Pacific. Back in Starling City, Oliver slowly reconnects with those closest to him. Oliver has brought back many new skills from his time on the island and despite the watchful eye of his new bodyguard John Diggle, Oliver manages to secretly create the persona of Arrow -- a vigilante -- to right the wrongs of his family and fight the ills of society. As Arrow, Oliver will atone for the past sins of his family while he searches for the personal redemption he needs.', 'Y', 'N', 8.5),
	('Arrow', 'Honor Thy Father', 1, 2, 'Yes', 'Yes', 'Yes', 17, 10, 2012, 'Oliver heads to the courthouse to get his death certificate repealed and is pleasantly surprised to run into Laurel, who is there prosecuting Martin Somers, a criminal with ties to the Chinese Triad. Oliver recognizes Martins name from his fathers book and sets his sights on taking him down. Martin orders the Triad to \'take care of\' Laurel so they send their top mercenary -- China White -- after her. Meanwhile, Moira and Walter ask Oliver to take over the company.', 'Y', 'N', 8.3),
	('Arrow', 'Lone Gunmen', 1, 3, 'Yes', 'Yes', 'Yes', 24, 10, 2012, 'Oliver is surprised when someone shoots and kills one of his targets. As his plan is to bring people to justice vs. outright killing them, Oliver doesn\'t appreciate the help and searches for the gunman. He soon learns that the man, Deadshot, is taking out businessmen who are scheduled to bid at an auction on an energy company and Walter is one of the bidders. Realizing he can\'t protect his family and stop Deadshot at the same time, Oliver enlists Detective Lance\'s help, but his plan has dire consequences. Meanwhile, Laurel and Tommy get caught in an awkward situation with Oliver.', 'Y', 'N', 8.5),
	('Arrow', 'An Innocent Man', 1, 4, 'Yes', 'Yes', 'Yes', 31, 10, 2012, 'Oliver still hasnt figured out how to get back in Laurel\'s good graces, but a late night bonding session with Thea gives him the inspiration he needs. Looking into a suspicious murder case, Oliver realizes an innocent man, Peter Declan, was framed by one of the targets on his list. As Arrow, he asks Laurel to help prove Declan\'s innocence. Meanwhile, Walter asks one of his employees, Felicity Smoak, to look into a $2.6 million withdrawal that Moira made without his knowledge.', 'Y', 'N', 8.5),
	('Arrow', 'Damaged', 1, 5, 'Yes', 'Yes', 'Yes', 7, 11, 2012, 'After Detective Lance arrests Oliver for murder, Oliver tells Moira the only lawyer hell allow to represent him is Laurel. Laurel takes the case which puts her at odds with her father. Oliver offers to take a polygraph in front Detective Lance but things get tense when Lance asks him if anyone else was on the island with him. Oliver flashes back to when he got his first scar, courtesy of Deathstroke.', 'Y', 'N', 8.7),
	('Arrow', 'Legacies', 1, 6, 'Yes', 'Yes', 'Yes', 14, 11, 2012, 'A gang of bank robbers, dubbed The Royal Flush Gang, hits a local bank and seriously wounds an off-duty police officer during a heist. Diggle tells Oliver he needs to deviate from his father\'s list and start helping the citizens of Starling City. Meanwhile, Tommy asks Thea for relationship advice, but things get awkward when she realizes he was asking about Laurel. Moira confronts Oliver about all of his recent disappearances in the middle of family functions.', 'Y', 'N', 8.1),
	('Arrow', 'Muse Of Fire', 1, 7, 'Yes', 'Yes', 'Yes', 28, 11, 2012, 'Oliver encounters a mysterious woman, Helena Bertinelli, daughter of mob boss Frank Bertinelli, who he can finally be himself with, but he soon comes to realize shes hiding dangerous secrets of her own. Helena is on her own personal mission of vengeance and Oliver is caught in the middle. Meanwhile, Tommy is blindsided by an unfortunate turn of events and turns to Laurel for support.', 'Y', 'N', 8.4),
	('Arrow', 'Vendetta', 1, 8, 'Yes', 'Yes', 'Yes', 5, 12, 2012, 'As Oliver and Helena grow closer, Oliver trains her to be his ally, complete with showing her how to use a crossbow. Diggle disapproves of Oliver sharing his secret with Helena as hes not sure she can be trusted, but Oliver refuses to listen to his concerns. Helenas quest for revenge proves to be too strong for Oliver to handle after she kills the head of the Triad and all hell breaks loose.', 'Y', 'N', 8.3),
	('Arrow', 'Year\'s End', 1, 9, 'Yes', 'Yes', 'Yes', 12, 12, 2012, 'Oliver discovers that after he and his father went missing, Moira and Thea stopped celebrating Christmas. Determined to make up for lost time and restore a sense of normalcy to the Queen household, Oliver decides to throw the family a Christmas party. Meanwhile, Tommy asks Laurel to spend Christmas with him but she points out that Christmas was also her sisters Saras birthday and she needs to be with her father. Tommy suggests changing things up might be the best way for everyone to heal but Laurel isnt sure her father is ready for that.', 'Y', 'N', 8.5),
	('Arrow', 'Burned', 1, 10, 'Yes', 'Yes', 'Yes', 16, 1, 2013, 'Olivers confidence is shaken after being beaten by the Dark Archer and he takes a break from being Arrow. However, when Laurel calls Arrow for help investigating a firefighters suspicious death, he reluctantly agrees but his hesitance while fighting almost costs him his life. Meanwhile, Tommy throws a benefit for the firefighters and Thea tries to lift Moira out of her depressive state.', 'Y', 'N', 8),
	('Arrow', 'Trust But Verify', 1, 11, 'Yes', 'Yes', 'Yes', 23, 1, 2013, 'The next person on Arrows list is Diggles commanding officer and mentor from Afghanistan, Ted Gaynor. Oliver suspects Ted is responsible for recent armoured truck robberies, but Diggle defends Ted and takes a job at Teds security company to keep an eye on him. Oliver decides to make a move on Ted, which puts him at odds with Diggle. Meanwhile, Thea  suspects that Moira is having an affair with Malcolm. Tommy and Laurel have an awkward dinner with Malcolm.', 'Y', 'N', 8.3),
	('Arrow', 'Vertigo', 1, 12, 'Yes', 'Yes', 'Yes', 30, 1, 2013, 'Thea is in trouble with the police after she gets caught using a drug called Vertigo. Oliver thinks the only way to keep her out of jail is to find the dealer, a man who goes by the name of The Count. Oliver turns to McKenna Hall, an old flame and current Vice cop, for help. Meanwhile, Laurel steps in to defend Thea, and Felicity gives Oliver some disturbing news about Moira.', 'Y', 'N', 8.6),
	('Arrow', 'Betrayal', 1, 13, 'Yes', 'Yes', 'Yes', 6, 2, 2013, 'Cyrus Vanch, a nefarious criminal, is recently released from prison and intends to re-secure his position as leader of the underworld. His first step is to take down his biggest opponent in the city  Arrow. Meanwhile, Oliver shows Moira his fathers notebook and questions her about the names on the list. Thea is miserable as she starts her internship with Laurel at the legal aid office and Detective Lance makes a deadly mistake that puts Laurel in the crosshairs of Vanch.', 'Y', 'N', 8.7),
	('Arrow', 'The Odyssey', 1, 14, 'Yes', 'Yes', 'Yes', 13, 2, 2013, 'After Oliver is shot, he turns to a surprising person for help  Felicity. Diggle is stunned when he sees Felicity walk through the front door of the lair dragging a dying Oliver behind her, and the two team up to save Olivers life. As Oliver hovers between life and death, he flashes back to a seminal event on the island  a daring escape attempt with his new friend Slade Wilson.', 'Y', 'N', 8.9),
	('Arrow', 'Dodger', 1, 15, 'Yes', 'Yes', 'Yes', 20, 2, 2013, 'Felicity tells Oliver hes all work and no play, so he asks Detective McKenna on a date. A jewel thief named Dodger hits Starling City and targets someone very close to Oliver. Meanwhile, while working with Laurel, Thea gets her purse stolen by a very fast pickpocket named Roy Harper. Moira makes a move against Malcolm.', 'Y', 'N', 8.2),
	('Arrow', 'Dead To Rights', 1, 16, 'Yes', 'Yes', 'Yes', 27, 2, 2013, 'Oliver and Diggle learn that Deadshot is still alive and his next target is Malcolm. Malcolm invites Tommy to attend a benefit honoring Malcolm for his work with Starling City but Tommy refuses to attend. Oliver encourages his friend to mend his relationship with his father while he can. Meanwhile, Oliver struggles to balance his new relationship with McKenna and his duties as Arrow.', 'Y', 'N', 8.8),
	('Arrow', 'The Huntress Returns', 1, 17, 'Yes', 'Yes', 'Yes', 20, 3, 2013, 'With his nightclub set to open and a new romance brewing with McKenna, Oliver is as happy as hes been since returning to Starling City. But when Olivers ex, The Huntress, suddenly returns to town, she threatens to destroy everything and everyone he cares about. Meanwhile, Laurel and her father struggle with the return of Dinah Lance who claims she has proof Sara is still alive. Thea gets Roy Harper a job at Olivers club, but hes not too inclined to stop his life of crime. Oliver and Tommy are thrilled they were able to get Steve Aoki to play at the opening of their new nightclub, Verdant.', 'Y', 'N', 8.3),
	('Arrow', 'Salvation', 1, 18, 'Yes', 'Yes', 'Yes', 27, 3, 2013, 'An angry resident of The Glades who calls himself The Savior embarks on a kidnapping and killing spree to punish those he believes have wronged the residents of his neighborhood. To make things worse, he broadcasts these murders online and claims he was inspired by Arrows vigilantism. Oliver is horrified by this statement and vows to stop The Savior, but his manhunt in intensified after Thea comes to him in tears and tells him Roy has been kidnapped. Laurel is surprised when her father starts to believe her mothers claim that Sara is still alive. Meanwhile, Malcom tells Moira to find the person responsible for his attempted murder.', 'Y', 'N', 8.5),
	('Arrow', 'Unfinished Business', 1, 19, 'Yes', 'Yes', 'Yes', 3, 4, 2013, 'When a young woman meets a violent death after partying at Verdant, Detective Lance and his new partner, Detective Hilton inform Oliver and Tommy that she was on the drug Vertigo. Oliver immediately pays a visit to the mental institution where The Count is locked up, but finds he is in no condition to deal drugs. However, when The Count escapes and Starling City is flooded with even more Vertigo-related violence, Oliver and Diggle make it their mission to track him down. After Detective Lance uncovers incriminating evidence against him, Tommy goes to great lengths to clear his name, and the fallout from his actions leads Tommy down a new, unexpected path. In a flashback to the island, Oliver recalls the lessons he learned from Slade and Shado.  ', 'Y', 'N', 8.4),
	('Arrow', 'Home Invasion', 1, 20, 'Yes', 'Yes', 'Yes', 24, 4, 2013, 'Deadshot returns to Starling City after taking down a U.S. Ambassador and six others overseas. By keeping tabs on A.R.G.U.S.s manhunt for the assassin, Oliver, Diggle, and Felicity learn that a sting operation is underway to capture Deadshot  alive. Diggle is determined to see his brothers killer dead, with or without Ollies help. Meanwhile, Laurel takes drastic steps to protect a young witness, exacerbating friction between Tommy and Oliver. Later, Roy Harper unconventionally pursues all leads to find his new hero, but runs afoul of Detective Lance. Back on the island, Oliver recalls how Shado helped him incrementally gain confidence with a bow and hit the target for the first time.', 'Y', 'N', 8.6),
	('Arrow', 'The Undertaking', 1, 21, 'Yes', 'Yes', 'Yes', 1, 5, 2013, 'Finding it difficult to mend fences with Tommy and Diggle, Oliver instead focuses on crossing another name off the list. While digging through a crooked accountants laptop, Felicity discovers a transaction that could help Oliver find Walter. To reconfirm the lead, Oliver gambles that Felicity can be counted on in the field for the first time. In a flashback, Malcolm reveals to Robert Queen and Frank Chen painful details surrounding his wifes murder, and how that shaped his plans for the Glades. Meanwhile, Tommy stuns Laurel with the truth.', 'Y', 'N', 8.9),
	('Arrow', 'Darkness On The Edge Of Town', 1, 22, 'Yes', 'Yes', 'Yes', 8, 5, 2013, 'With the Undertaking days away, Malcolm dons his black hood to conclude business with seismologist Dr. Brion Markov and his team. Oliver and Moira entertain a number of surprise - and mostly unwelcome - visitors. Hooded confrontations at home and the Merlyn Global Group reveal dark secrets. Meanwhile, Roy and Thea are still looking out for a hero. Laurel makes a decision after Tommy\'s revelation. In a flashback to the island, Oliver, Slade and Shado struggle to prevent Fyers from shooting a Ferris Air jet out of the sky.', 'Y', 'N', 9.1),
	('Arrow', 'Sacrifice', 1, 23, 'Yes', 'Yes', 'Yes', 15, 5, 2013, 'Oliver and Diggle race to stop the Dark Archer from unleashing his vengeance on The Glades. However, they run into a roadblock after Detective Lance picks up Felicity for questioning. Tommy and Olivers already tumultuous relationship takes a turn for the worse after Oliver makes a confession about Laurel. After hearing of the danger in The Glades, Thea races to find Roy, inadvertently putting herself directly in the line of fire for Malcolms devious plan. On the island, Oliver, Slade and Shado are locked in a life-or-death struggle against Fyers as his missiles lock on a full Ferris Air jetliner.', 'Y', 'N', 9.5),
	('Arrow', 'City Of Heroes', 2, 1, 'Yes', 'Yes', 'Yes', 9, 10, 2013, 'Diggle and Felicity travel to Lian Yu in search of Oliver who left Starling City after The Undertaking. Convinced to return home, Oliver finds that things are in worse shape than he thought  Isabel Rochev is preparing a hostile takeover of Queen Consolidated, Thea refuses to visit Moira  in jail, Roy  is trying to fill the void left by the Arrows absence, and Laurel is working with the District Attorneys office to take down the vigilante. Meanwhile, flashbacks to the island show Slade, Shado  and Oliver in a desperate situation.', 'Y', 'N', 8.9),
	('Arrow', 'Identity', 2, 2, 'Yes', 'Yes', 'Yes', 16, 10, 2013, 'Oliver finds out the medicine that is being sent to Glades Memorial is being hijacked by thieves. Without an influx of supplies, the hospital will close. Roy attempts to stop the thieves, but he fails and is arrested by Officer Lance. Oliver gets into a heated battle with China White and her new partner, Ben Turner, AKA the Bronze Tiger, over the supplies.  Meanwhile, Laurel makes plans to catch the Arrow, and Thea gives Roy an ultimatum.', 'Y', 'N', 8.7),
	('Arrow', 'Broken Dolls', 2, 3, 'Yes', 'Yes', 'Yes', 23, 10, 2013, 'Lance learns a criminal named Barton Mathis, whom he put away years ago, broke out of prison during the quake and is back to torturing and murdering women. Felicity offers herself as bait so Arrow, Diggle and Lance can catch this villain, but the plan goes awry. Furious, Mathis kidnaps Laurel in retaliation and plans to murder her while Lance watches. Meanwhile, Thea and Oliver are stunned when District Attorney Adam Donner seeks the death penalty for Moira. Oliver asks Roy to help him find the Canary.', 'Y', 'N', 8.9),
	('Arrow', 'Crucible', 2, 4, 'Yes', 'Yes', 'Yes', 30, 10, 2013, 'Oliver discovers a man who goes by the name The Mayor is bringing illegal guns in to The Glades, so Oliver sponsors a Cash for Guns event to help clean up the city. Unfortunately, The Mayor crashes the event with his gang and seriously injures Sin. The Canary is furious when she learns her friend is in the hospital and sets out for revenge. Meanwhile, Felicity stuns Oliver with a bit of information about the Canary, Donner asks Laurel to dinner, and Diggle reconnects with an old friend.', 'Y', 'N', 8.8),
	('Arrow', 'League Of Assassins', 2, 5, 'Yes', 'Yes', 'Yes', 6, 11, 2013, 'While Oliver tends to the Canarys wounds, he tries to get her to talk about where she came from but she refuses. However, after Oliver and the Canary are attacked at the Queen mansion by a trained killer from the League of Assassins, she confesses to how shes connected with the nefarious group. Meanwhile with Moira facing multiple counts of murder and conspiracy for her part in the destruction of The Glades, the Assistant District Attorney offers her a choice  plead guilty now and avoid the death penalty or take your chances in court. Thea begs her mother to fight for her life but Moira seems resolute about taking the offer. Meanwhile, Oliver is furious with Laurel for joining the prosecutions team on his mothers case.', 'Y', 'N', 8.9),
	('Arrow', 'Keep Your Enemies Closer', 2, 6, 'Yes', 'Yes', 'Yes', 13, 11, 2013, 'Amanda Waller sends A.R.G.U.S. agents to kidnap Diggle. Waller informs Diggle that Lyla has gone missing after following a lead on Deadshot in Moscow. When Diggle tells the team hes headed to Russia to rescue Lyla, Oliver and Felicity decide to join, but things get messy when Isabel shows up on the tarmac and insists on joining Olivers work trip. Meanwhile, Moiras lawyer, Jean, tells Thea that dating Roy, a known criminal, is hurting her mothers case.', 'Y', 'N', 8.6),
	('Arrow', 'State V. Queen', 2, 7, 'Yes', 'Yes', 'Yes', 20, 11, 2013, 'Oliver is concerned when a mysterious illness sweeps the city, infecting hundreds of people, including Diggle. Oliver discovers Vertigo in Diggle\'s blood and realizes The Count has broken out of prison and is once again distributing his drug. Meanwhile, Moira goes on trial for her participation in the Undertaking. ADA Adam Donner collapses in court with Vertigo symptoms so Laurel must step in and try the case against Moira. Oliver is torn between standing by his family during the trial and catching The Count. However, things change when Felicity follows a lead and walks straight into a trap set by The Count.', 'Y', 'N', 8.7),
	('Arrow', 'The Scientist', 2, 8, 'Yes', 'Yes', 'Yes', 4, 12, 2013, 'A seemingly impossible robbery at Queen Consolidateds Applied Sciences Division brings Central City police scientist Barry Allen to town. Citing a similar case back home, Barry offers to help Oliver and team with the investigation. Oliver senses there is more to Barry than meets the eye, but hes distracted by the similarities between this current case and something that happened on the island. Meanwhile, Felicity takes a liking to Barry, which doesnt go unnoticed by Oliver. Sin asks Roy for help when a friend of hers goes missing. Roy is surprised when Thea not only encourages him to help, but joins the search. Unfortunately, Sins friend is connected to Brother Blood, and their search ultimately gets one of them seriously injured.', 'Y', 'N', 9.1),
	('Arrow', 'Three Ghosts', 2, 9, 'Yes', 'Yes', 'Yes', 11, 12, 2013, 'After a fight with Cyrus Gold AKA the Acolyte, Oliver is drugged and left for dead. Determined to cure him, Felicity makes a risky decision. The cure causes Oliver to hallucinate, and what he sees forces him to confront his past. Meanwhile, Barry continues to help Felicity, and their connection grows stronger. The Arrow asks Lance to look into Gold, but when the stakeout on Gold goes bad, someone is killed. Roy is captured and tortured by Brother Blood.', 'Y', 'N', 9.4),
	('Arrow', 'Blast Radius', 2, 10, 'Yes', 'Yes', 'Yes', 15, 1, 2014, 'Oliver must tackle a new threat to the city when bombs start to go off in Starling City. Felicity discovers the person setting them off is Mark Sheffer, a man who goes by the nickname Shrapnel. Arrow discovers Shrapnels next target is Sebastian Bloods Unity Rally and tries to talk the alderman out of hosting it, but he refuses. Arrow sets off to stop the bombing, but Shrapnel tricks him and traps him in a bomb-laced antique store where he is unable to move without setting off the device. While Felicity helps Oliver, Diggle races to the plaza to find the bomb before it goes off. Meanwhile, Roy continues to hide his new strength from Thea but, after she witnesses his super strength in action at the rally, she demands answers. Laurels suspicions about Sebastian grow stronger once she learns that he grew up with Cyrus Gold, the man who killed Lances partner. After Donner refuses to help her investigate, she turns to Arrow for help. ', 'Y', 'N', 8.5),
	('Arrow', 'Blind Spot', 2, 11, 'Yes', 'Yes', 'Yes', 22, 1, 2014, 'Oliver is conflicted after Laurel reaches out to the Arrow asking him to investigate Sebastian Blood. Oliver is unsure whether to believe her accusations against the man he has publically supported for mayor, but decides to trust Laurel. However, when the pair gets too close to the truth, Sebastian exposes Laurels drug addiction and has her arrested. Meanwhile, Roy reveals his new super-strength to Sin who wants to test out his abilities. Unfortunately, Roy isnt able to contain his rage once unleashed and almost kills a man. Back on the island, Oliver is surprised when Sara reveals a secret about Laurel. ', 'Y', 'N', 8.8),
	('Arrow', 'Tremors', 2, 12, 'Yes', 'Yes', 'Yes', 29, 1, 2014, 'Arrow offers to train Roy so he can learn to control his newfound super-strength. However, Roy is a rebellious student and refuses to listen unless Arrow reveals his true identity, which Oliver refuses to do. Meanwhile, the Bronze Tiger escapes from prison and steals Malcolms earthquake machine to sell to the highest bidder. Oliver, Diggle and Felicity attempt to stop the transfer, but Roy gets in the way, putting everyone in danger. Laurel is disbarred and spirals out of control. Moira is thrilled when Walter asks her to dinner, but his reason surprises her. Thea encourages her mother to ask Walter to reconcile.', 'Y', 'N', 8.8),
	('Arrow', 'Heir To The Demon', 2, 13, 'Yes', 'Yes', 'Yes', 5, 2, 2014, 'As Laurel continues to unravel, Oliver and Lance try to convince Sara to stay in Starling City and finally reunite with Laurel and Dinah. However, Saras fellow League of Assassins member, Nyssa, comes to bring Sara back to the fold, but when Sara refuses, Nyssa kidnaps Dinah. Realizing shes putting her family in danger by staying in town, Sara considers re-joining the league.', 'Y', 'N', 8.8),
	('Arrow', 'Time Of Death', 2, 14, 'Yes', 'Yes', 'Yes', 26, 2, 2014, 'Oliver brings Sara into the Arrow team. Watching Oliver and Diggle spar with Sara and talk old scars, Felicity starts to feel left out. The team is investigating a villain named William Tockman, a.k.a. The Clock King, who is a brilliant thief armed with technology that can open any bank vault in Starling City. After The Clock King infiltrates the computer systems in the lair, Felicity feels pressure to prove her worth. When she gets a lead on Tockmans whereabouts, she heads out without the team, putting her in peril. Meanwhile, Oliver throws Sara a welcome home party, but Laurel refuses to attend. After Lance makes his case for a family dinner, Laurel acquiesces, but when Oliver shows up with Sara, she loses her temper on both of them.', 'Y', 'N', 8.9),
	('Arrow', 'The Promise', 2, 15, 'Yes', 'Yes', 'Yes', 5, 3, 2014, 'Oliver is shocked when he learns that Slade has come to Starling City. Back on the island, as Oliver, Slade and Sara prepare to take over the freighter from Ivo, Sara pulls Oliver aside and tells him he needs to kill Ivo to prevent him from telling Slade what happened with Shado. Oliver feels immense guilt over the situation but realizes Slades growing rage from the Mirakuru makes him unpredictable and he could turn on his friends if he thinks Oliver is to blame. Oliver agrees to kill Ivo and the battle begins.', 'Y', 'N', 9.2),
	('Arrow', 'Suicide Squad', 2, 16, 'Yes', 'Yes', 'Yes', 19, 3, 2014, 'Following Slades return and his promise to make good on his threat to destroy Olivers loved ones, Oliver focuses all his energy on preparing for battle with his former friend. Sarah tries to help but, fearing for her safety, Oliver pushes her away. Meanwhile, Diggle is recruited by Amanda Waller and A.R.G.U.S. to stop a warlord he knew from his time in Afghanistan. Always the soldier, Diggle agrees to help. However, hes not prepared when Amanda introduces him to the rest of the team  Deadshot, Bronze Tiger and Shrapnel, all criminals he and Arrow helped put away. Lyla defends the team and explains the world is a complicated place, but Diggle isnt sure he agrees. When the mission takes a dangerous turn, Diggle is forced to make a difficult decision.', 'Y', 'N', 8.7),
	('Arrow', 'Birds Of Prey', 2, 17, 'Yes', 'Yes', 'Yes', 26, 3, 2014, 'When Frank Bertinelli is arrested, Oliver knows its only a matter of time before his daughter, Helena, AKA The Huntress, returns to town. To make matters worse, Laurel is picked to try Franks case, putting her right in the path of Helena. Oliver tells Sara he will handle his ex-girlfriend, but when Helena takes hostages at the courthouse, including Laurel, the Canary will stop at nothing to save her sister. When The Huntress and Canary meet, an epic battle begins. Meanwhile, Roy realizes he needs to keep Thea safe, but doesnt like the way he is forced to go about it.', 'Y', 'N', 8.4),
	('Arrow', 'Deathstroke', 2, 18, 'Yes', 'Yes', 'Yes', 2, 4, 2014, 'Slade makes his move against Oliver and the repercussions are enormous. While Oliver scrambles to protect his family, a key player in his team starts to question Olivers decisions. Meanwhile, Isabel makes her move to take Queen Consolidated away from Oliver.', 'Y', 'N', 9.3),
	('Arrow', 'The Man Under The Hood', 2, 19, 'Yes', 'Yes', 'Yes', 16, 4, 2014, 'Oliver, Canary, Diggle and Felicity return to the lair and find Slade waiting for them. An epic battle breaks out and one member of Team Arrow is sent to the hospital. Thea hits her breaking point, but just as Oliver is about to reach her, Slade intervenes and Oliver is faced with a choice  his battle with Slade or his family. Meanwhile, Laurel struggles with a new secret.', 'Y', 'N', 9.1),
	('Arrow', 'Seeing Red', 2, 20, 'Yes', 'Yes', 'Yes', 23, 4, 2014, 'The mirakuru sends Roy into an uncontrollable rage and he unleashes on the city. After Roys deadly fight with a police officer, Oliver realizes the mirakuru has taken over Roy completely and must figure out a way to stop him. Things get more complicated after Sara declares that Roy is too far gone and the only way to stop him is to kill him. Meanwhile, Thea believes she can breakthrough to Roy so she goes on camera at Moiras campaign rally to lure him to Verdant. Her ploy works but after Roy attacks Thea, Team Arrow unleashes on him.', 'Y', 'N', 9.4),
	('Arrow', 'City Of Blood', 2, 21, 'Yes', 'Yes', 'Yes', 30, 4, 2014, 'After Slade threatens to take everything Oliver loves away, Oliver decides the fastest way to stop further bloodshed is to surrender to his enemy. Knowing that surrender will surely lead to Oliver\'s death, Diggle and Felicity go to extreme measures to keep Oliver from confronting Slade. Meanwhile, Thea considers leaving town, and Laurel resumes her crusade against Sebastian Blood. Finally, Slade unleashes his assault on Starling City.', 'Y', 'N', 9.1),
	('Arrow', 'Streets Of Fire', 2, 22, 'Yes', 'Yes', 'Yes', 7, 5, 2014, 'Oliver rallies his team as Slades soldiers attack the city. Felicity gets a call from S.T.A.R. Labs with game-changing news and Thea comes face-to-face with her father  Malcolm Merlyn.', 'Y', 'N', 9.3),
	('Arrow', 'Unthinkable', 2, 23, 'Yes', 'Yes', 'Yes', 14, 5, 2014, 'Slade moves forward with his plan to kill one more person in Olivers life. While Oliver has fought all year to be more than the killer he once was, when Slade kidnaps someone close to Olivers heart, Oliver is pushed to the edge and realizes sometimes it takes doing the unthinkable to stop the monster. Meanwhile, Diggle takes on Amanda Waller with a little help from some friends, and Thea turns to Roy in her time of need.', 'Y', 'N', 9.5),
	('Arrow', 'The Calm', 3, 1, 'Yes', 'Yes', 'Yes', 8, 10, 2014, 'With crime in Starling City at an all-time low, Oliver thinks he can finally balance being both the Arrow and Oliver Queen and asks Felicity out on a date. Diggle becomes a father, Lance is promoted to Captain, Laurel joins Arrows inner circle and Felicity gets a part-time job at a tech store to make ends meet. Oliver fights to regain his company, Queen Consolidated, but comes up against a very worthy opponent  the charming Ray Palmer.', 'Y', 'N', 9),
	('Arrow', 'Sara', 3, 2, 'Yes', 'Yes', 'Yes', 15, 10, 2014, 'Lance calls the Arrow when another archer appears in town and starts skewering businessmen. Diggle uses A.R.G.U.S. to find the archers identity; he is a man named Simon Lacroix, who goes by the codename Komodo. However, the team hits a rough patch with the mission and gets help from a surprising source  Laurel. Meanwhile, Oliver begins to worry that he hasnt heard from Thea, which forces Roy to tell him the truth about why she left town. Ray Palmer pursues Felicity. In the flashback, Maseo tells Oliver that Amanda Waller has ordered his first kill. As Oliver looks down the scope of the rifle, he sees the target is his best friend, Tommy. Despite her promise to her sister, Laurel debates sharing a secret about Sara with Lance.', 'Y', 'N', 8.7),
	('Arrow', 'Corto Maltese', 3, 3, 'Yes', 'Yes', 'Yes', 22, 10, 2014, 'Oliver decides its time for Thea to come back to Starling City, so he packs for Corto Maltese, where Felicity has traced Theas whereabouts. Lyla asks Diggle to go with Oliver because one of her field operatives, Mark Shaw, has gone dark in Corto Maltese and shed like him to look into it. Feeling responsible for Theas departure, Roy joins Oliver and Diggle on their journey. Shaw double-crosses Diggle, putting numerous A.R.G.U.S. agents, including Lyla, at risk. Meanwhile, Laurel meets Ted Grant, and Felicity adjusts to her new job.', 'Y', 'N', 8.5),
	('Arrow', 'The Magician', 3, 4, 'Yes', 'Yes', 'Yes', 29, 10, 2014, 'A furious Nyssa confronts Oliver about Sara, then join forces against the Dark Archer, intent on bringing the killer to justice. Laurel keeps her distance from Nyssa. Oliver and Roy work on repairing their respective relationships with Thea, who has returned home. Nyssa discusses Oliver with her father.', 'Y', 'N', 8.7),
	('Arrow', 'The Secret Origin Of Felicity Smoak', 3, 5, 'Yes', 'Yes', 'Yes', 5, 11, 2014, 'When a cyber attack brings Starling City to its knees, Oliver and Felicity are pushed to their limits to contain the destruction. Life gets even more complicated for Felicity when her mother, Donna, stops by for a surprise visit. Ted questions Laurels motives. Thea buys an apartment with Malcolms \'estate\' money.', 'Y', 'N', 8.7),
	('Arrow', 'Guilty', 3, 6, 'Yes', 'Yes', 'Yes', 12, 11, 2014, 'After a body is found strung up in the Wildcat gym, Ted becomes the main suspect. Oliver and Laurel argue over Teds innocence. When Maseo needs Oliver to remember where an informant for China White stashed key information, he asks Tatsu to help jog Olivers memory. Roy shares a secret with Felicity.', 'Y', 'N', 8.4),
	('Arrow', 'Draw Back Your Bow', 3, 7, 'Yes', 'Yes', 'Yes', 19, 11, 2014, 'Oliver must stop an Arrow-obsessed serial killer, Carrie Cutter, who is convinced that The Arrow is her one true love and will stop at nothing to get his attention. Unfortunately, her way of getting his attention is to kill people. Meanwhile, Ray asks Felicity to be his date for a work dinner with important clients. Thea auditions new DJs for Verdant and meets Chase, a brash DJ with whom she immediately clashes.', 'Y', 'N', 8.3),
	('Arrow', 'The Brave And The Bold', 3, 8, 'Yes', 'Yes', 'Yes', 3, 12, 2014, 'A crossover event that began on \'The Flash\' concludes with Oliver teaming with the Flash to stop a boomerang-wielding killer who plants five bombs in the city that are set to explode at the same time.', 'Y', 'N', 9.3),
	('Arrow', 'The Climb', 3, 9, 'Yes', 'Yes', 'Yes', 10, 12, 2014, 'Nyssa returns to Starling City and tells Oliver that her father, Ras al Ghul has given Oliver 48 hours to find Saras killer or the League of Assassins will start killing the citizens of Starling City. Laurel is stunned when her father delivers a very special Christmas gift  her mother, Dinah. Meanwhile, Ray tries to make amends with Felicity and Oliver sets a meeting with Ras al Ghul.', 'Y', 'N', 9.7),
	('Arrow', 'Left Behind', 3, 10, 'Yes', 'Yes', 'Yes', 21, 1, 2015, 'In the aftermath of Olivers fight with Ras al Ghul, Diggle and Arsenal continue to protect the city in the Arrows absence. However, after three days without hearing from Oliver, they begin to fear the worst may have happened to their friend. Felicity refuses to believe that Oliver could be dead until Merlyn pays the team a surprise visit. Thea suspects there is something more behind Olivers disappearance and asks Merlyn for a favor. Meanwhile, Ray tests a part of his new suit and Laurel takes up the mantle of the Black Canary.', 'Y', 'N', 8.6),
	('Arrow', 'Midnight City', 3, 11, 'Yes', 'Yes', 'Yes', 28, 1, 2015, 'Arsenal and Diggle confront Laurel about trying to step into her sisters shoes and warn her to stop before she gets herself killed. However, when Brick kidnaps the citys Aldermen and threatens to kill them all unless the police evacuate The Glades, its all suits on deck. Meanwhile, Ray steps in to help Lance and the police force fight Brick, showing Felicity a new side of her boss. Malcom tells Thea that Ras al Ghul is after him and his family and they must leave town immediately.', 'Y', 'N', 8.2),
	('Arrow', 'Uprising', 3, 12, 'Yes', 'Yes', 'Yes', 4, 2, 2015, 'Still operating without Oliver and desperate to stop Brick, Team Arrow is forced to consider Malcolms offer to help shut Brick down as Malcolm has a personal score to settle with the felon. Roy and Laurel point out that the team could use some help to save the innocents of The Glades, but Felicity is adamantly against it. They look to Diggle to make the final decision. Meanwhile, the flashbacks chronicle Malcolms descent from kind-hearted father and husband to cold-blooded killer after the murder of his wife.', 'Y', 'N', 8.7),
	('Arrow', 'Canaries', 3, 13, 'Yes', 'Yes', 'Yes', 11, 2, 2015, 'Oliver is thrown by the changes within Team Arrow. Hes used to calling the shots but sees that the team has evolved in his absence and tensions quickly escalate in the lair. Oliver is furious that Laurel has been going out as the Black Canary and tells her to stop risking her life, but when Vertigo hits the streets again, Laurel goes against Olivers wishes and tracks down Vertigo who hits her with a full dose of the drug. Laurels biggest fears revolve around her sister Sara so the Vertigo causes her to hallucinate an epic fight between Canary and Black Canary. Meanwhile, Chase surprises Thea, and Roy warns Thea to stay away from Malcolm.', 'Y', 'N', 8.6),
	('Arrow', 'The Return', 3, 14, 'Yes', 'Yes', 'Yes', 18, 2, 2015, 'Malcolm puts Oliver and Thea in a dangerous situation that lands them on Lian Yu with Olivers former enemy, Deathstroke. A flashback reveals when Oliver and Maseo returned to Starling City to retrieve the Omega bio weapon, and despite being under strict orders from Amanda Waller not to reveal himself to anyone, Oliver looks in on his family, Laurel and Tommy.', 'Y', 'N', 8.5),
	('Arrow', 'Nanda Parbat', 3, 15, 'Yes', 'Yes', 'Yes', 25, 2, 2015, 'Malcolm is captured by Ras al Ghul and taken to Nanda Parbat. Because of his love for Thea, Oliver considers saving Merlyn. Ray is obsessed with finishing his Atom suit so he can save the city but Felicity fears he is heading down the same path as Oliver and tries to pull him out of the lab.', 'Y', 'N', 9),
	('Arrow', 'The Offer', 3, 16, 'Yes', 'Yes', 'Yes', 28, 3, 2015, 'Still weighed down by his last meeting with Ra\'s al Ghul, Oliver returns home to find a new villain and his crew has started terrorizing Starling City - Michael Amar AKA Murmur a man whose mouth has been sewn shut. Meanwhile, Laurel and Nyssa bond over their issues with their fathers and Nyssa makes Laurel an offer. Thea is forced to come to terms with her father after Oliver brings Malcom to the loft to recover, and Lance shuts out both Laurel and the Arrow.', 'Y', 'N', 8.6),
	('Arrow', 'Suicidal Tendencies', 3, 17, 'Yes', 'Yes', 'Yes', 25, 3, 2015, 'It\'s celebration time as Diggle and Lyla get married. However, Deadshot interrupts their honeymoon, and tells them the Suicide Squad has been given a new mission - rescue United States Senator Joseph Cray from a hostage situation in the Republic of Kasnia. Amanda Waller breaks down the mission and introduces them to the newest member of the Suicide Squad, Cupid. Meanwhile, Oliver learns about Ray\'s new Atom costume and the two have a heated stand-off. Felicity and Ray hit a rough patch.', 'Y', 'N', 8.6),
	('Arrow', 'Public Enemy', 3, 18, 'Yes', 'Yes', 'Yes', 1, 4, 2015, 'During an attack on the mayor\'s office, Ray is critically injured. Felicity is pleasantly surprised when her mother, Donna Smoak, shows up at the hospital to offer her support. With the SCPD out in full force looking for the assailant, Oliver and his team work hard to stay one step ahead of the police to find the man responsible. However, things come to a head when Ra\'s al Ghul kidnaps Captain Lance.', 'Y', 'N', 9),
	('Arrow', 'Broken Arrow', 3, 19, 'Yes', 'Yes', 'Yes', 15, 4, 2015, 'Lance continues his mission to take down the Arrow so Felicity orders Oliver to keep a low profile. However, when a meta-human named Jake Simmons, who kills people with blasts of energy and plasma, starts terrorizing Starling City, Oliver is forced to ask Ray for help. The unlikely duo is forced to team up to save the city.', 'Y', 'N', 9.1),
	('Arrow', 'The Fallen', 3, 20, 'Yes', 'Yes', 'Yes', 22, 4, 2015, 'Ras al Ghul finally makes Oliver an offer he cant refuse. The team joins Oliver on his journey to Nanda Parbat where a heartbroken Felicity decides to take matters into her own hands.', 'Y', 'N', 8.9),
	('Arrow', 'Al Sah-him', 3, 21, 'Yes', 'Yes', 'Yes', 29, 4, 2015, 'Oliver goes through a rigorous transformation. The League of Assassins sets their sights on Nyssa, who is back in Starling City training Laurel. When Nyssa realizes they are coming, she arms up to face them alone but Laurel asks Felicity and Diggle to help protect her new friend.', 'Y', 'N', 8.6),
	('Arrow', 'This Is Your Sword', 3, 22, 'Yes', 'Yes', 'Yes', 6, 5, 2015, 'Oliver/Al Sah-him finishes his training and is left with two final tasks to become the next Ra\'s al Ghul. Ra\'s threatens Nyssa and delivers some shocking news. Meanwhile, Malcolm makes a surprising offer to Team Arrow and Thea goes to see Roy.', 'Y', 'N', 8.9),
	('Arrow', 'My Name Is Oliver Queen', 3, 23, 'Yes', 'Yes', 'Yes', 13, 5, 2015, 'Everyone\'s lives are in danger as Ra\'s al Ghul puts forth his final plan. Oliver/Al Sah-him must decide if he\'s strong enough to take on this new role and what it will mean for everyone on Team Arrow, and his soul.', 'Y', 'N', 8.3),
	('Arrow', 'Green Arrow', 4, 1, 'Yes', 'Yes', 'Yes', 7, 10, 2015, 'Oliver and Felicity\'s blissful getaway is cut short when Thea and Laurel pay them a visit and tell Oliver they need his help back in Star City. The city has been attacked by \'Ghosts\', assassins led by a dangerous man named Damien Darhk. However, when Oliver returns, Diggle makes it very clear that he doesn\'t want Oliver on the team.', 'Y', 'N', 8.6),
	('Arrow', 'The Candidate', 4, 2, 'Yes', 'Yes', 'Yes', 14, 10, 2015, 'When an old family friend, Jessica Danforth, tells Oliver and Thea that she is going to run for mayor, both Queens are concerned considering the last three mayors have been murdered. Despite their protests, Jessica makes her announcement so the Green Arrow and Speedy vow to protect her. Meanwhile, Thea begins to exhibit effects from the Lazarus Pit. In addition, Felicity is faced with a tough business decision and looks to one of her employees, Curtis Holt, for help.', 'Y', 'N', 8.3),
	('Arrow', 'Restoration', 4, 3, 'Yes', 'Yes', 'Yes', 21, 10, 2015, 'The growing tension between Oliver and Diggle puts both their lives at risk when they go after Damien Darhk and a H.I.V.E. deployed meta-human. Meanwhile, Laurel talks Thea into returning to Nanda Parbat to ask her father to put Sara into the Lazarus Pit. However, Laurel is surprised when Nyssa refuses to do it.', 'Y', 'N', 8.3),
	('Arrow', 'Beyond Redemption', 4, 4, 'Yes', 'Yes', 'Yes', 28, 10, 2015, 'Laurel must deal with the repercussions of taking Sara to Nanda Parbat. Meanwhile, Oliver asks Captain Lance for a favor and while he\'s not surprised at the response, he is surprised at what he finds out next.', 'Y', 'N', 8.5),
	('Arrow', 'Haunted', 4, 5, 'Yes', 'Yes', 'Yes', 4, 11, 2015, 'When things take a turn for the worse with Sara, Oliver calls in a favor from an old friend who deals in the mystical, John Constantine.', 'Y', 'N', 9),
	('Arrow', 'Lost Souls', 4, 6, 'Yes', 'Yes', 'Yes', 11, 11, 2015, 'Felicity is frantic when she learns that Ray is alive and being held by Damien Darhk. Felicity\'s guilt over not finding Ray sooner causes tension between her and Oliver. Meanwhile, Sara joins Laurel, Thea, and the team on a rescue mission for Ray. However, the effects of the Lazarus Pit take over and threaten to jeopardize the entire operation. Donna Smoak returns to Star City.', 'Y', 'N', 8.2),
	('Arrow', 'Brotherhood', 4, 7, 'Yes', 'Yes', 'Yes', 18, 11, 2015, 'Team Green Arrow\'s ongoing battle with Damien Darhk is complicated by a shocking revelation. Thea\'s bloodlust returns and she loses control in front of Alex.', 'Y', 'N', 8.3),
	('Arrow', 'Legends Of Yesterday', 4, 8, 'Yes', 'Yes', 'Yes', 2, 12, 2015, 'Oliver and Barry Allen take Kendra Saunders and Carter Hall to a remote location to keep them hidden from Vandal Savage while they figure out how to defeat him. Malcolm arranges a meeting between Vandal, Green Arrow and The Flash that doesn\'t go as planned. Meanwhile, Felicity, Thea, Diggle and Laurel work with Team Flash to come up with a weapon powerful enough to destroy Vandal Savage. This cross-over episode began on The Flash\'s season 2 \'Legends of Today\' episode.', 'Y', 'N', 9.2),
	('Arrow', 'Dark Waters', 4, 9, 'Yes', 'Yes', 'Yes', 9, 12, 2015, 'After the city is attacked again, Oliver makes a bold move against HIVE. Malcolm checks in on Thea and leaves her with a warning. Things take a horrible turn when Damien Darhk retaliates in a brutal manner at Oliver\'s mayoral holiday party.', 'Y', 'N', 9),
	('Arrow', 'Blood Debts', 4, 10, 'Yes', 'Yes', 'Yes', 20, 1, 2016, 'Oliver must deal with the devastating consequences of Darhk\'s last attack. Seeking revenge, Oliver goes on a brutal manhunt looking for Dahrk.', 'Y', 'N', 8.2),
	('Arrow', 'A.W.O.L.', 4, 11, 'Yes', 'Yes', 'Yes', 27, 1, 2016, 'Diggle must learn to trust his brother Andy when an enemy of their wartime past, an agent of the criminal organization Shadowspire, pays a visit to Star City. However, Diggle learns more than he bargained for about their shared time at war. Meanwhile, Oliver has to learn a whole new way of life.', 'Y', 'N', 8.1),
	('Arrow', 'Unchained', 4, 12, 'Yes', 'Yes', 'Yes', 3, 2, 2016, 'The team faces off against a formidable villain nicknamed The Calculator. Meanwhile, Nyssa makes her move and Roy Harper returns to Star City.', 'Y', 'N', 8.4),
	('Arrow', 'Sins Of The Father', 4, 13, 'Yes', 'Yes', 'Yes', 10, 2, 2016, 'Oliver receives an offer from Nyssa that is hard to refuse. Meanwhile, Thea continues to battle the blood lust, Malcolm steps in to help his daughter, and Laurel has a heart to heart talk with Nyssa.', 'Y', 'N', 8.5),
	('Arrow', 'Code Of Silence', 4, 14, 'Yes', 'Yes', 'Yes', 17, 2, 2016, 'Oliver and team uncover HIVE\'s plan to take out Team Arrow once and for all. With HIVE\'s next attack imminent, Lance wonders if Donna is safer without him in her life. Meanwhile, with the wedding fast approaching, Oliver begins to feel guilty that he hasn\'t told Felicity about his son.', 'Y', 'N', 8),
	('Arrow', 'Taken', 4, 15, 'Yes', 'Yes', 'Yes', 24, 2, 2016, 'Oliver realizes he needs help battling Darhk so he calls in an old friend Vixen. Using her magical ability to summon animal powers, Vixen gets a lock on Darhk\'s location and the team goes to war. Meanwhile, Thea has a heart-to-heart talk with Malcolm.', 'Y', 'N', 8.4),
	('Arrow', 'Broken Hearts', 4, 16, 'Yes', 'Yes', 'Yes', 23, 3, 2016, 'A heartbroken Cupid returns to Star City with one goal - to destroy anyone in love. The team learns she\'s killing couples on their wedding day so Oliver and Felicity decide to pose as bait.', 'Y', 'N', 6.2),
	('Arrow', 'Beacon Of Hope', 4, 17, 'Yes', 'Yes', 'Yes', 30, 3, 2016, 'Brie Larvan breaks out of jail and turns up at Palmer Tech threatening to kill everyone unless she gets the bio-chip that is implanted in Felicity\'s spine. When Oliver realizes that Felicity, Thea and Donna are trapped in Palmer Tech with everyone else, he looks to a surprising ally to help Team Arrow save the day.', 'Y', 'N', 6.9),
	('Arrow', 'Eleven-Fifty-Nine', 4, 18, 'Yes', 'Yes', 'Yes', 6, 4, 2016, 'Oliver and Diggle learn that Merlyn is going to try to break Darhk out of prison. Meanwhile, Laurel gets a surprising offer.', 'Y', 'N', 7.1),
	('Arrow', 'Canary Cry', 4, 19, 'Yes', 'Yes', 'Yes', 27, 4, 2016, 'Oliver and the team struggle to come to terms with Laurel\'s death, especially Diggle who is overwhelmed with guilt for choosing to believe Andy had changed. Meanwhile, Lance refuses to believe his daughter is really gone and asks Nyssa to help bring her back. A recent Black Canary sighting in Star City only seems to prove his theory that Laurel isn\'t actually dead.', 'Y', 'N', 6.7),
	('Arrow', 'Genesis', 4, 20, 'Yes', 'Yes', 'Yes', 4, 5, 2016, 'As Oliver and Felicity look for a magical solution to defeat Darhk, a vengeance-driven Diggle gets a lead on Andy\'s whereabouts and heads off to confront his brother. Meanwhile, Alex takes Thea on a vacation that quickly turns into a nightmare.', 'Y', 'N', 7.5),
	('Arrow', 'Monument Point', 4, 21, 'Yes', 'Yes', 'Yes', 11, 5, 2016, 'When Team Arrow learns what Damien Darhk\'s next move is Felicity realizes she needs to ask her father, Noah Kuttler, for help. Noah and Oliver have a heart to heart talk that leaves Oliver rattled.', 'Y', 'N', 7.2),
	('Arrow', 'Lost In The Flood', 4, 22, 'Yes', 'Yes', 'Yes', 18, 5, 2016, 'Oliver and Diggle race to rescue Thea, while Felicity, Curtis and Noah join together to stop Darhk.', 'Y', 'N', 7.1),
	('Arrow', 'Schism', 4, 23, 'Yes', 'Yes', 'Yes', 25, 5, 2016, 'Oliver teams up with a surprising force in an attempt to stop Damien Darhk and his magic once and for all.', 'Y', 'N', 8.4),
	('Arrow', 'Legacy', 5, 1, 'No', 'No', 'No', 5, 10, 2016, 'After Laurel\'s death and the departures of both Diggle and Thea from Team Arrow, Oliver takes to the streets solo to protect Star City\'s citizens as the Green Arrow. With Felicity guiding him from the bunker, Oliver is forced to deal with a city that has become overrun with both criminals and a slew of new (and painfully inexperienced) vigilantes. Watching Oliver try to balance his jobs as both the mayor and also the protector of Star City, Felicity suggests he form a new team, but Oliver resists. However, when a deadly new criminal, Tobias Church, enters the picture, Oliver realizes the best thing for the city might be a new team of superheroes. Meanwhile, the flashbacks take us to Russia where Oliver faces off against the Bratva.', 'N', 'N', 8.6),
	('Arrow', 'The Recruits', 5, 2, 'No', 'No', 'No', 12, 10, 2016, 'Olivers new recruits for Team Arrow are Curtis, Wild Dog and Evelyn Sharp. Unfortunately, the Green Arrows training methods prove to be too much for some of them to handle. Meanwhile, in the flashbacks, Olivers initiation into the Bratva continues.', 'N', 'N', 8.5),
	('Arrow', 'A Matter Of Trust', 5, 3, 'No', 'No', 'No', 19, 10, 2016, 'Now that Oliver has his new team, they are ready to hit the streets but Oliver doesnt feel they are ready. Headstrong Wild Dog defies the Green Arrows orders and sets out on his own after a new drug dealer, Derek Sampson, who is terrorizing Star City. Sampson proves more powerful than Wild Dog and it is up to the Green Arrow to go head to head with Sampson to save his teammate.', 'N', 'N', 8.4),
	('Arrow', 'Penance', 5, 4, 'No', 'No', 'No', 26, 10, 2016, 'Oliver and Lyla team up on a secret mission for Diggle. Felicity finds out and disapproves of the plan and opts to stay behind. When Tobias Church launches a deadly assault against the city, Felicity must decide if she wants to send the recruits out sans the Green Arrow.', 'N', 'N', 8.4),
	('Arrow', 'Human Target', 5, 5, 'No', 'No', 'No', 2, 11, 2016, 'When Tobias Church captures and tortures one of Oliver\'s new recruits, Oliver must turn to an old friend, Christopher Chance AKA the Human Target, for help. Meanwhile, Felicity\'s worlds collide when Detective Malone joins the ACU.', 'N', 'N', 8.9),
	('Arrow', 'So It Begins', 5, 6, 'No', 'No', 'No', 9, 11, 2016, 'Prometheus claims two more victims, and Oliver realizes that the killings are related to the people on his father\'s list. His recruits aren\'t happy to hear that Oliver used to be a serial killer. In the past, Oliver finally meets Kovar and may not live to regret it.', 'N', 'N', 8.5),
	('Arrow', 'Vigilante', 5, 7, 'No', 'No', 'No', 16, 11, 2016, 'When the bodies of two criminals are dropped at SCPD, Oliver realizes there is a new Vigilante in Star City. The team is split about whether they should stop someone who is helping keep the city safe. Diggle is frustrated with his new situation and Thea fights for Lance who confesses a shocking secret. Meanwhile, in the flashbacks, Oliver finally sits down with Konstantin Kovar.', 'N', 'N', 8.5),
	('Arrow', 'Invasion', 5, 8, 'No', 'No', 'No', 30, 11, 2016, 'Oliver wakes up to a life where he never got on The Queens Gambit.  Robert and Moira Queen are alive and well.  Laurel is his loving fiance and their wedding is imminent.  Everything seems perfect, but Oliver starts to notice small imperfections that make him question this new reality.  Meanwhile, Felicity and the recruits take on a new threat with help from The Flash and Supergirl.  ', 'N', 'N', 9.3),
	('Arrow', 'What We Leave Behind', 5, 9, 'No', 'No', 'No', 7, 12, 2016, 'After Prometheus attacks Curtis, Oliver realizes Prometheus knows all of Team Arrows secret identities and is planning to come for them one by one. Felicity and Detective Malone discover a clue that links Prometheus to Olivers past. ', 'N', 'N', 9.5),
	('Arrow', 'Who Are You', 5, 10, 'No', 'No', 'No', 25, 1, 2017, 'Worried that Prometheus is right and he is truly a killer at heart, Oliver looks for any ray of hope and finds it in what seems to be the miraculous return of Laurel Lance. However, Felicity, still reeling from Detective Malones murder, is bent on revenge  she wants to stop Prometheus at any cost. While in prison, Diggle fights for his life. ', 'N', 'N', 8.1),
	('Arrow', 'Second Chances', 5, 11, 'No', 'No', 'No', 1, 2, 2017, 'In his quest to take down Kovar, Oliver gets help from a surprising source  Talia al Ghul. However, when she reveals what she wants from him in exchange, Oliver isnt sure he can accept her help. Felicity attempts to hack the NSA to help free Diggle but when her online efforts are flagged, she faces off against an unknown adversary. Meanwhile, Curtis tells the team about a female vigilante, Tina Boland, he uncovered online who has been wreaking havoc all over the country.', 'N', 'N', 8.5),
	('Arrow', 'Bratva', 5, 12, 'No', 'No', 'No', 8, 2, 2017, 'A mission takes Oliver, Felicity and team to Russia where they meet up with Olivers old friend, Anatoly. Meanwhile, fresh out of rehab, Lance returns to the mayors office ready to get back to work. However, when Susan asks for an interview with Lance to discuss his addiction, he balks and its up to Rene to help keep things on track. ', 'N', 'N', 8.4),
	('Arrow', 'Spectre Of The Gun', 5, 13, 'No', 'No', 'No', 15, 2, 2017, 'A traumatic attack on City Hall triggers painful memories for Rene about his family. Flashbacks reveal how Rene went from simple family man to a hero named Wild Dog. Meanwhile, Oliver must deal with the perpetrator behind the attack and realizes the best way to do so is as Mayor Queen instead of the Green Arrow. Tensions run high in the Arrow bunker. ', 'N', 'N', 7.7),
	('Arrow', 'The Sin-Eater', 5, 14, 'No', 'No', 'No', 22, 2, 2017, 'China White, Cupid and Liza Warner break out of Iron Heights and head to Star City for revenge. Oliver tries to bring in the newly formed girl gang but the ACU intervenes mid-fight. To his surprise, they are there to arrest the Green Arrow for the murder of Detective Malone. Meanwhile, Lance  feels responsible for the prison break after Warner tells him she heard about him working with Damien Darhk.', 'N', 'N', 8.1),
	('Arrow', 'Fighting Fire With Fire', 5, 15, 'No', 'No', 'No', 1, 3, 2017, 'Oliver faces his biggest challenge yet as mayor. Felicity continues down her dark path with Helix. After Vigilante attacks Oliver while hes acting as the mayor, Diggle leads the team in a mission to stop Vigilante once and for all. ', 'N', 'N', 8.8),
	('Arrow', 'Checkmate', 5, 16, 'No', 'No', 'No', 15, 3, 2017, 'Oliver gets closer to the truth about Prometheus. Meanwhile, Helix refuses to continue helping Felicity until she does a favor for them.   ', 'N', 'N', 9.2),
	('Arrow', 'Kapiushon', 5, 17, 'No', 'No', 'No', 22, 3, 2017, 'Prometheus goes to great lengths to break Oliver. Meanwhile, in the flashbacks, Anatoly becomes worried about Olivers increasingly violent tendencies, which come to a head in a brutal confrontation.', 'N', 'N', 9.4),
	('Arrow', 'Disbanded', 5, 18, 'No', 'No', 'No', 29, 3, 2017, 'Diggle and Felicity are shocked by Olivers decision to call on the Bratva to help take down Prometheus. Concerned the Bratva may overstep, Diggle has a hard conversation with Oliver about what happens if things go south. Meanwhile, Felicity learns something shocking at Helix. ', 'N', 'N', 8.8),
	('Arrow', 'Dangerous Liaisons', 5, 19, 'No', 'No', 'No', 26, 4, 2017, 'Oliver, Team Arrow, ARGUS and the SCPD kick off a citywide manhunt for Adrian Chase. Helix tells Felicity they have a way to find Chase but they will need something big, and illegal, from her in return.', 'N', 'N', 8.2),
	('Arrow', 'Underneath', 5, 20, 'No', 'No', 'No', 3, 5, 2017, 'Things get intense when Oliver and Felicity are trapped in the bunker together. Meanwhile, Lyla and Diggle deal with their marital issues. ', 'N', 'N', 7.9),
	('Arrow', 'Honor Thy Fathers', 5, 21, 'No', 'No', 'No', 10, 5, 2017, 'Oliver returns to the mayors office and faces one of his most pressing issues yet  the forced release of dozens of violent criminals prosecuted by Adrian Chase. Meanwhile, a crate is delivered to Olivers office containing a mysterious corpse encased in concrete. ', 'N', 'N', 8.6),
	('Arrow', 'Missing', 5, 22, 'No', 'No', 'No', 17, 5, 2017, 'Black Siren returns to help Chase. Felicity organizes a birthday party for Oliver while Lance is furious after Rene misses the custody hearing for his daughter. ', 'N', 'N', 9.5),
	('Arrow', 'Lian Yu', 5, 23, 'No', 'No', 'No', 24, 5, 2017, 'The battle between Oliver and Adrian Chase culminates in a final epic battle on Lian Yu. After recent events, Oliver decides to recruit a group of unlikely allies  Slade, Nyssa, Merlyn, and Digger Harkness  to defeat Chase. However, Chase has his own army  Black Siren, Evelyn Sharp, and Talia al Ghul.', 'N', 'N', 9.1),
	('Black Mirror', 'The National Anthem', 1, 1, 'Yes', 'Yes', 'No', 4, 12, 2011, 'A twisted parable for the Twitter age, The National Anthem looks at how life is very much harder for the rich and supposedly powerful now that information is disseminated so quickly and public opinion is so loud, powerful and quick to change. It\'s a political thriller in which the Prime Minister faces a huge dilemma - and that\'s all that can be revealed for now...', 'N', 'N', 8.1),
	('Black Mirror', '15 Million Merits', 1, 2, 'Yes', 'Yes', 'No', 11, 12, 2011, 'Set in a sarcastic version of a future reality, 15 Million Merits is a satire on entertainment shows and our insatiable thirst for distraction. In this world, everyone is confined to a life of strange physical drudgery. The only way to escape this life is to enter the \'Hot Shot\' talent show and just pray you can impress the judges.', 'N', 'N', 8.4),
	('Black Mirror', 'The Entire History Of You', 1, 3, 'Yes', 'Yes', 'No', 18, 12, 2011, 'Set in an alternative reality where everyone has access to a system which records everything they do, see or hear. You need never forget a face, a holiday or a night out again... but is that always a good thing?', 'N', 'N', 8.7),
	('Black Mirror', 'Be Right Back', 2, 1, 'Yes', 'Yes', 'No', 11, 2, 2013, 'Martha and Ash are a young couple who move to a remote cottage. The day after the move, Ash is killed returning the hire van. At the funeral, Martha\'s friend Sarah tells her about a new service that lets people stay in touch with the deceased. By using all his past online communications and social media profiles, a new \'Ash\' can be created. Martha is disgusted by the concept but then in a confused and lonely state she decides to talk to \'him\'', 'N', 'N', 8.2),
	('Black Mirror', 'White Bear', 2, 2, 'Yes', 'Yes', 'No', 18, 2, 2013, 'Victoria wakes up and cannot remember anything about her life. Everyone she encounters refuses to communicate with her and enjoys filming her discomfort on their phones. Victoria meets Jem, who explains that a signal is being transmitted that has turned most of the population into dumb voyeurs. This apathy has allowed the unaffected, the \'hunters\', to do what they want and they are out to get people like her and Victoria. Jem and Victoria set out to destroy the transmitter, but can they manage it and will it end their torment?', 'N', 'N', 8.3),
	('Black Mirror', 'The Waldo Moment', 2, 3, 'Yes', 'Yes', 'No', 25, 2, 2013, 'Meet Waldo a CGI blue bear from a children\'s educational TV show who in reality is an anarchic character on a satirical late-night topical comedy show. Behind the scenes, Waldo is voiced and controlled by failed comedian Jamie Salter. When the channel decide they would like to give Waldo his own pilot, the production company enter him into a political race against one of his victims, Conservative Liam Monroe, for a stunt. Jamie isn\'t comfortable with politics - he just sees himself as a clown - but once the wheels start turning there\'s no stopping the thing. So what can Jamie do?', 'N', 'N', 7.1),
	('Black Mirror', 'Nosedive', 3, 1, 'Yes', 'Yes', 'No', 21, 10, 2016, 'Insecure office worker Lacie lives in a happy, smiley, status-obsessed nightmare world. Her old friend Naomi is one of societys elites, and Lacie may have found a way to join her', 'N', 'N', 8.3),
	('Black Mirror', 'Playtest', 3, 2, 'Yes', 'Yes', 'No', 21, 10, 2016, 'A thrill-seeking globetrotter visits Britain, hooks up with a woman and tests the latest in video game technology  a device as mind-bendingly sophisticated as it is terrifying.', 'N', 'N', 8.3),
	('Black Mirror', 'Shut Up And Dance', 3, 3, 'Yes', 'Yes', 'No', 21, 10, 2016, 'When withdrawn 19-year-old Kenny stumbles headlong into an online trap, he is quickly forced into an uneasy alliance with shifty Hector  both of them at the mercy of persons unknown.', 'N', 'N', 8.5),
	('Black Mirror', 'San Junipero', 3, 4, 'Yes', 'Yes', 'No', 21, 10, 2016, 'California, 1987: San Junipero is a fun-loving beach town synonymous with sun, surf, and sex. And for recent arrivals Yorkie and Kelly, its going to be a life-changer', 'N', 'N', 8.9),
	('Black Mirror', 'Men Against Fire', 3, 5, 'Yes', 'Yes', 'No', 21, 10, 2016, 'A military story set in a post-war future. A rookie soldier is posted overseas, protecting frightened villagers from an infestation of vicious feral mutants alongside fellow soldier Raiman. Theyre hoping some new technological advantage will save them. ', 'N', 'N', 8),
	('Black Mirror', 'Hated In The Nation', 3, 6, 'Yes', 'Yes', 'No', 21, 10, 2016, 'A police detective and her geeky young sidekick investigate a string of grisly murders with a sinister link to social media.', 'N', 'N', 8.8),
	('Blackadder', 'The Foretelling', 1, 1, 'Yes', 'Yes', 'No', 15, 6, 1983, 'After arriving late for the Battle of Bosworth Field, Edmund kills King Richard III (whom he thinks is stealing his horse) and secures the crown for his father.', 'Y', 'N', 7.7),
	('Blackadder', 'Born To Be King', 1, 2, 'Yes', 'Yes', 'No', 22, 6, 1983, 'With his father away at the Crusades, Edmund comes up with a plan to prove his brother is illegitimate, thus making him Prince Regent.', 'Y', 'N', 7.6),
	('Blackadder', 'The Archbishop', 1, 3, 'Yes', 'Yes', 'No', 29, 6, 1983, 'Edmund is appointed to the post of Archbishop of Canterbury after the king has the last one killed.', 'Y', 'N', 8),
	('Blackadder', 'The Queen Of Spain\'s Beard', 1, 4, 'Yes', 'Yes', 'No', 6, 7, 1983, 'The King decides that Edmund should marry a Spanish Princess, who Edmund finds unattractive, in order to secure a treaty between Spain and England which will allow an invasion of France.', 'Y', 'N', 8.1),
	('Blackadder', 'The Witchsmeller Pursuivant', 1, 5, 'Yes', 'Yes', 'No', 13, 7, 1983, 'Percy and Baldrick are to be burned at the stake with Edmund, when he is accused of being a witch.', 'Y', 'N', 7.9),
	('Blackadder', 'The Black Seal', 1, 6, 'Yes', 'Yes', 'No', 20, 7, 1983, 'After the King takes away Edmund\'s title of Duke, he recruits the 6 most evil men in the land to take the crown by force.', 'Y', 'N', 7.8),
