	('Blackadder', 'Head', 2, 2, 'Yes', 'Yes', 'No', 16, 1, 1986, 'After the Queen appoints Blackadder Lord High Executioner, he finds himself in trouble when the Queen pardons someone he executed ahead of schedule.', 'Y', 'N', 8.5),
	('Blackadder', 'Potato', 2, 3, 'Yes', 'Yes', 'No', 23, 1, 1986, 'After Sir Walter Raleigh takes the Queen\'s fancy by bringing her a potato, Blackadder decides to become an explorer with the aid of a legless sea captain.', 'Y', 'N', 8.4),
	('Blackadder', 'Money', 2, 4, 'Yes', 'Yes', 'No', 6, 2, 1986, 'The Queen hampers Blackadder\'s efforts to raise cash to pay off a debt to a sadistic bishop. ', 'Y', 'N', 8.2),
	('Blackadder', 'Beer', 2, 5, 'Yes', 'Yes', 'No', 13, 2, 1986, 'Blackadder\'s rich and Puritanical aunt and uncle pay him a visit to discuss his inheritance the same night he has a beer drinking contest.', 'Y', 'N', 8.7),
