	('Blackadder', 'Dish And Dishonesty', 3, 1, 'Yes', 'Yes', 'No', 17, 9, 1987, 'Blackadder becomes involved in politics by getting Baldrick elected MP, in an effort to stop the new Prime Minister, Pitt the Younger, from striking the Prince off the Civil List.', 'Y', 'N', 8.5),
	('Blackadder', 'Ink And Incapability', 3, 2, 'Yes', 'Yes', 'No', 24, 9, 1987, 'Blackadder has one weekend to rewrite a dictionary the Prince Regent is sponsoring after Baldrick burns the only copy.', 'Y', 'N', 8.8),
