	('Blackadder', 'Sense And Senility', 3, 4, 'Yes', 'Yes', 'No', 8, 10, 1987, 'The Prince Regent hires a pair of actors to teach him to give better speeches and earn the people\'s respect after an anarchist tries to blow him up at the theatre.', 'Y', 'N', 8.3),
