	('Blackadder', 'Major Star', 4, 3, 'Yes', 'Yes', 'No', 12, 10, 1989, 'Blackadder grabs yet another opportunity to return to England by organizing a morale-raising music hall show, including Baldrick\'s Charlie Chaplin impersonation and George\'s appearance as a lady songstress who captures the General\'s heart', 'Y', 'N', 8.5),
