	('Breaking Bad', 'Pilot', 1, 1, 'Yes', 'Yes', 'Yes', 20, 1, 2008, 'When an unassuming high school chemistry teacher discovers he has a rare form of lung cancer, he decides to team up with a former student and create a top of the line crystal meth in a used RV, to provide for his family once he is gone.', 'Y', 'N', 9),
	('Breaking Bad', 'Cat\'s In The Bag...', 1, 2, 'Yes', 'Yes', 'Yes', 27, 1, 2008, 'Walt and Jesse attempt to tie up loose ends. The desperate situation gets more complicated with the flip of a coin. Walt\'s wife, Skyler, becomes suspicious of Walt\'s strange behavior.', 'Y', 'N', 8.7),
	('Breaking Bad', '...And The Bag\'s In The River', 1, 3, 'Yes', 'Yes', 'Yes', 10, 2, 2008, 'Walter fights with Jesse over his drug use, causing him to leave Walter alone with their captive, Krazy-8. Meanwhile, Hank has a scared straight moment with Walter Jr. after his aunt discovers he has been smoking pot. Also, Skylar is upset when Walter stays away from home.', 'Y', 'N', 8.8),
	('Breaking Bad', 'Cancer Man', 1, 4, 'Yes', 'Yes', 'Yes', 17, 2, 2008, 'Walter finally tells his family that he has been stricken with cancer. Meanwhile, the DEA believes Albuquerque has a new, big time player to worry about. Meanwhile, a worthy recipient is the target of a depressed Walter\'s anger, and Jesse makes a surprise visit to his parents home.', 'Y', 'N', 8.4),
