	('Breaking Bad', 'Mandala', 2, 11, 'Yes', 'Yes', 'Yes', 17, 5, 2009, 'When unforeseen circumstances cause Walt and Jesse to lose some dealers, Saul suggests they add a new business partner. At work, Skylar confronts Ted about the unnerving information she had uncovered. Jane learns what Jesse does for a living when he opens up to her, which ends in disastrous results.', 'Y', 'N', 8.9),
