	('Breaking Bad', 'Hazard Pay', 5, 3, 'Yes', 'Yes', 'Yes', 29, 7, 2012, 'Walt, Jessie, and Mike\'s business starts back up. Walt finds an ingenious solution to the problem of where to set up the lab, Jesse makes a decision about his personal life, and Mike visits each of his crew to ensure that they stay mum, even with the feds pressuring them. Hank goes back to work. Skyler remains numb, and Marie badgers her about what\'s wrong. Walt is in for a surprise when Mike divides the money from the first cook.', 'Y', 'N', 9),
