	('Breaking Bad', 'Dead Freight', 5, 5, 'Yes', 'Yes', 'Yes', 12, 8, 2012, 'Walt\'s team gets creative to obtain the methylamine they need to continue their operation.', 'Y', 'N', 9.7),
	('Breaking Bad', 'Buyout', 5, 6, 'Yes', 'Yes', 'Yes', 19, 8, 2012, 'Walter, Jesse, Mike and their associate deal with the aftermath of the methyl-amine train heist. Mike and Jesse begin to have doubts about their ability to continue in the meth business. Walter invites Jesse to his home to talk Walter tells Jesse that Skyler sent their children to live elsewhere and is waiting for his \'cancer to come back\', and that that he intends to continue cooking meth at all costs, because \'the business\' is all he has left.', 'Y', 'N', 9.1),
	('Breaking Bad', 'Say My Name', 5, 7, 'Yes', 'Yes', 'Yes', 26, 8, 2012, 'Walt takes control of business matters. Mike deals with the consequences of his actions. The DEA takes down Mike\'s lawyer losing everyones money to the DEA again but Walter finds out and warns Mike. Walter being the only person not being watched by the DEA agrees to take Mike his emergency getaway bag.', 'Y', 'N', 9.5),
