	('Castle', 'Flowers For Your Grave', 1, 1, 'Yes', 'Yes', 'No', 9, 3, 2009, 'Author Richard Castle joins NYC Detective Kate Beckett to help solve the case of a serial killer who is reenacting murders from Castle\'s novels; Castle becomes very intrigued with the murders and continues to shadow Beckett, much to her chagrin.', 'Y', 'N', 8.6),
	('Castle', 'Nanny McDead', 1, 2, 'Yes', 'Yes', 'No', 16, 3, 2009, 'When a body of a young woman is found inside the dryer at a laundry room, Castle and Beckett uncover that the young woman worked as a nanny in the upscale building. Meanwhile, as Castle works on his \'Nikki Heat\' novel series he watches Beckett\'s actions as she works the murder case. ', 'Y', 'N', 7.9),
	('Castle', 'Hedge Fund Homeboys', 1, 3, 'Yes', 'Yes', 'No', 23, 3, 2009, 'When a teenaged boy whose family has recently fallen on hard times is found dead in a boat in Central Park, Castle and Beckett must piece together the mystery behind the boy\'s final moments. Meanwhile, Castle mulls over leaving Martha home while he chaperones Alexis\' trip to Washington, D.C.', 'Y', 'N', 8),
	('Castle', 'Hell Hath No Fury', 1, 4, 'Yes', 'Yes', 'No', 30, 3, 2009, 'The investigation behind a body found wrapped in a rug on the sidewalk leads Castle and Beckett deep inside the world of New York City politics. The partners discover a world of expensive escorts, arrogant tycoons, corrupt investigators, and the effects of betrayal.', 'Y', 'N', 8),
	('Castle', 'A Chill Goes Through Her Veins', 1, 5, 'Yes', 'Yes', 'No', 6, 4, 2009, 'Castle and Beckett investigate the murder of a women found frozen and tangled in steel bars at a construction site. The case leads them to look into an old case and also has Beckett thinking about some memories of her past.', 'Y', 'N', 8.3),
	('Castle', 'Always Buy Retail', 1, 6, 'Yes', 'Yes', 'No', 13, 4, 2009, 'A man is killing people and posing them in Vodun (Voodoo) tradition. Castle\'s ex-wife announces her plans to move back to New York.', 'Y', 'N', 8),
	('Castle', 'Home Is Where The Heart Stops', 1, 7, 'Yes', 'Yes', 'No', 20, 4, 2009, 'After discovering a young woman\'s body stuffed awkwardly into a jewelry safe, Beckett and Castle investigate numerous cases involving murders and home invasion jewel heists.', 'Y', 'N', 8.3),
	('Castle', 'Ghosts', 1, 8, 'Yes', 'Yes', 'No', 27, 4, 2009, 'Castle and Beckett investigate the murder of a woman found drowned in motor oil in a motel bathtub. They seek the help of a true crime journalist who might have a connection to the victim.', 'Y', 'N', 8.2),
	('Castle', 'Little Girl Lost', 1, 9, 'Yes', 'Yes', 'No', 4, 5, 2009, 'When a two-year-old girl is discovered missing from her home, Beckett is called in to assist with the investigation only to discover that the FBI agent in charge is, in fact, her ex-boyfriend. The two of them try to put aside their unresolved feelings as they race to find the girl, but when Castle inserts himself into the investigation, competition quickly heats up for Beckett\'s attention.', 'Y', 'N', 8),
	('Castle', 'A Death In The Family', 1, 10, 'Yes', 'Yes', 'No', 11, 5, 2009, 'Castle and Beckett investigate the murder of a missing plastic surgeon who is found dead in the front seat of his car after a week of being parked curbside. As they delve into the twisted world of surgery obsessed patients and secret operations, Castle experiences a fatherly rite of passage as Alexis attends her first prom. And while looking into Beckett\'s past, he unearths information that could end his relationship with her forever.', 'Y', 'N', 8.5),
	('Castle', 'Deep In Death', 2, 1, 'Yes', 'Yes', 'No', 21, 9, 2009, 'When the new season begins, Castle is wrestling with how to repair his relationship with Beckett, while struggling to finish his soon-to-be-published bestseller, Heat Wave. But circumstances force the pair back together to investigate the mysterious murder of a man found dead, tangled in the limbs of a tree.', 'Y', 'N', 8.4),
	('Castle', 'The Double Down', 2, 2, 'Yes', 'Yes', 'No', 28, 9, 2009, 'When two separate murders are committed on the same night, Castle wagers Ryan and Esposito that he and Beckett will solve theirs first. The frenzied race to catch their respective killers and win the bet leads each investigative duo to a likely suspect, only to find that they both have airtight alibis. But bizarre twists in both cases force the two teams to work together to unravel the mind-bending mystery behind each murder.', 'Y', 'N', 8.6),
	('Castle', 'Inventing The Girl', 2, 3, 'Yes', 'Yes', 'No', 5, 10, 2009, 'Castle and Beckett get an inside look at the cutthroat world of the New York fashion industry when they investigate the brutal murder of a young model during Fashion Week.', 'Y', 'N', 8.1),
	('Castle', 'Fool Me Once...', 2, 4, 'Yes', 'Yes', 'No', 12, 10, 2009, 'When an Arctic explorer is killed during a polar expedition, the mysterious circumstances of his death take Castle and Beckett from the penthouses of Park Avenue to the halls of the CIA. But Castle\'s delight at the case\'s many twists and turns soon turns to frustration as he realizes that their elusive killer might just be fooling them all.', 'Y', 'N', 8.7),
	('Castle', 'When The Bough Breaks', 2, 5, 'Yes', 'Yes', 'No', 19, 10, 2009, 'Castle has a new book agent, Paula Haas, but she talks with him when he has gotten an opportunity that may change his career. The downside is that taking the opportunity would mean the end of his relationship with Beckett. Meanwhile, an unidentified woman is found dead in a manhole. ', 'Y', 'N', 8.5),
	('Castle', 'Vampire Weekend', 2, 6, 'Yes', 'Yes', 'No', 26, 10, 2009, 'As Halloween approaches, Castle and Beckett are called to a graveyard where the body of a young man sporting vampire fangs has been discovered with a wooden stake driven through his heart. Their investigation takes them deep into the heart of New York\'s underground vampire fetish community, where they learn that the motive for the victim\'s murder may be hiding within the pages of the graphic novel he was writing before his death.', 'Y', 'N', 8.8),
	('Castle', 'Famous Last Words', 2, 7, 'Yes', 'Yes', 'No', 2, 11, 2009, 'An up-and-coming rock star\'s body is found in a scene that appears staged from her recent music video.', 'Y', 'N', 8),
	('Castle', 'Kill The Messenger', 2, 8, 'Yes', 'Yes', 'No', 9, 11, 2009, 'After a bike messenger, carrying a package with content that is able to free a wrongly convicted man from prison, is brutally murdered, Castle and Beckett need to investigate the case. But they are surprised to find out that the tragic death is linked to another murder case previously investigated by Captain Montgomery. Now, in order to solve the new murder, Castle and Beckett must dig deep and discover all the secrets of a prominent New York family.', 'Y', 'N', 8.2),
	('Castle', 'Love Me Dead', 2, 9, 'Yes', 'Yes', 'No', 16, 11, 2009, 'Castle and Beckett are thrust into the world of ex-cons and escorts. Meanwhile, Alexis has a private chat with Beckett about something that she\'s keeping from her father. ', 'Y', 'N', 8.4),
	('Castle', 'One Man\'s Treasure', 2, 10, 'Yes', 'Yes', 'No', 23, 11, 2009, 'When a murdered man is found stuffed in the garbage chute of an apartment building and two women arrive to ID his body one his wife and the other his fiancee Castle and Beckett have their hands full keeping the women from killing each other as they work to peel back the layers of the victim\'s double life. Was it a jilted woman, corporate espionage, or a much darker secret that led to his demise?', 'Y', 'N', 8.4),
	('Castle', 'The Fifth Bullet', 2, 11, 'Yes', 'Yes', 'No', 7, 12, 2009, 'Castle and Beckett uncover that a bullet is missing from the crime scene while investigating what happened when an art dealer was gunned down in his own gallery. However, when it turns out there was a witness to the murder, they need to refresh the man\'s memory, only to find out that he suffers from amnesia and can\'t even remember who he is.', 'Y', 'N', 8.7),
	('Castle', 'A Rose For Everafter', 2, 12, 'Yes', 'Yes', 'No', 11, 1, 2010, 'When Castle and Beckett are called to a wedding to investigate the death of a bridesmaid, Castle is stunned to discover that the soon-to-be bride is his old flame, Kyra, \'the one that got away\'. Complications ensue as Kyra, caught off-guard by Castle\'s reappearance in her life, wonders if she\'s marrying the right guy. With the nuptials forestalled and the entire wedding party under suspicion, Beckett questions Castle\'s ability to be objective about the case. But when it looks to Beckett like Castle and Kyra might rekindle their romance, her judgment may be compromised as well.', 'Y', 'N', 8.7),
	('Castle', 'Sucker Punch', 2, 13, 'Yes', 'Yes', 'No', 18, 1, 2010, 'While investigating the death of an Irish mobster, Beckett and Castle uncover a local turf war that may be connected to both a late-night infomercial guru and an international drug smuggling operation. But the case turns agonizingly personal when evidence emerges that the killer they\'re chasing may have had a hand in Beckett\'s mother\'s murder.', 'Y', 'N', 9),
	('Castle', 'The Third Man', 2, 14, 'Yes', 'Yes', 'No', 25, 1, 2010, 'Mysteries abound when a family returns from vacation to discover a dead man in their daughter\'s bed. Thinking they\'re investigating the murder of a squatter, Castle and Beckett soon find themselves unraveling a multi-million dollar heist. Meanwhile, Castle tries to keep Beckett from finding out that they\'ve been romantically linked when he\'s featured as one of New York\'s 10 most eligible bachelors.', 'Y', 'N', 8.6),
	('Castle', 'Suicide Squeeze', 2, 15, 'Yes', 'Yes', 'No', 8, 2, 2010, 'A beloved former major league baseball player is found dead after a goodwill trip to Cuba. The investigation, which includes running into Joe Torre, leads the detectives into New York\'s Cuban community to solve the murder. Meanwhile, Alexis\' genealogy project forces Castle to consider the identity of his unknown father.', 'Y', 'N', 7.9),
	('Castle', 'The Mistress Always Spanks Twice', 2, 16, 'Yes', 'Yes', 'No', 8, 3, 2010, 'When a half-naked woman is found covered in caramel sauce and hanging by bondage cuffs in a public park, Castle and Beckett\'s investigation takes them into New York\'s underground world of sexual domination. Naturally the case serves as sexy fodder for their already charged relationship banter.', 'Y', 'N', 8.3),
	('Castle', 'Tick, Tick, Tick...', 2, 17, 'Yes', 'Yes', 'No', 22, 3, 2010, 'Federal Agent Jordan Shaw, an insightful and accomplished Federal investigator teams up with Castle & Beckett to hunt down a cunning and elusive serial killer.', 'Y', 'N', 9.3),
	('Castle', 'Boom!', 2, 18, 'Yes', 'Yes', 'No', 29, 3, 2010, 'In the second part of the story begun in \'Tick, Tick, Tick\', the serial killer remains at large and is taunting Castle, Beckett and Jordan Shaw to catch him', 'Y', 'N', 9.1),
	('Castle', 'Wrapped Up In Death', 2, 19, 'Yes', 'Yes', 'No', 5, 4, 2010, 'The investigation into the shocking death of a museum curator, crushed by a falling gargoyle, takes a bizarre turn when Castle and Beckett learn that he isn\'t the first member of a recent archeological expedition to die. It turns out there was a legend inscribed over the burial chamber the team unearthed warning that all who gaze upon the face of the mummy are doomed. Was the curator just the latest victim of The Mummy\'s Curse? And if so, what does that mean for Castle, who snuck a peek at the mummy when no one was looking?', 'Y', 'N', 8.3),
	('Castle', 'The Late Shaft', 2, 20, 'Yes', 'Yes', 'No', 12, 4, 2010, 'When Castle appears on a late-night talk show to promote his book, Heat Wave, legendary host Bobby Mann leans in during a commercial break and whispers, \'They want me dead\'. When Mann dies later that night, seemingly of natural causes, Castle has to convince Beckett that there was foul play. During the investigation, Castle is seduced by a Hollywood hottie, who was the other guest on Bobby Mann\'s show the night he died.', 'Y', 'N', 8.1),
	('Castle', 'Den Of Thieves', 2, 21, 'Yes', 'Yes', 'No', 19, 4, 2010, 'Investigating the murder of a thief, Castle and Beckett are surprised to learn that Esposito has a personal connection to the suspected killer. Another surprise is in line for Castle when Beckett hits it off with the handsome Robbery detective assigned to the case, Tom Demming. Now this romantic triangle must work together to solve the case', 'Y', 'N', 8.4),
	('Castle', 'Food To Die For', 2, 22, 'Yes', 'Yes', 'No', 3, 5, 2010, 'A high profile chef is found frozen to death in the kitchen of a hot New York restaurant. Complications ensue when Castle and the restaurant owner, an old high school girlfriend of Beckett\'s, share an attraction. Meanwhile, Beckett\'s relationship with Det. Demming continues to grow.', 'Y', 'N', 8.3),
	('Castle', 'Overkill', 2, 23, 'Yes', 'Yes', 'No', 10, 5, 2010, 'A robbery-homicide prompts Beckett to invite Demming to assist on a case, giving Castle a ringside seat to their budding romance. When it becomes clear that the two men have very different ideas about how to proceed, the investigation becomes an unspoken competition for Beckett\'s attention, one in which each man races to solve the case, as Beckett referees between her two admirers.', 'Y', 'N', 8),
	('Castle', 'A Deadly Game', 2, 24, 'Yes', 'Yes', 'No', 17, 5, 2010, 'Nothing is as it seems when Castle and Beckett investigate what appears to be the assassination of an intelligence operative. Meanwhile, Beckett\'s romance with Demming threatens her relationship with Castle, forcing them to confront their feelings for each other.', 'Y', 'N', 8.8),
	('Castle', 'A Deadly Affair', 3, 1, 'Yes', 'Yes', 'No', 20, 9, 2010, 'When Beckett and her team burst into an apartment on a murderer\'s trail, they see Castle standing over a dead woman\'s body holding a gun; Beckett arrests Castle as he asserts his innocence.', 'Y', 'N', 8.7),
	('Castle', 'He\'s Dead, She\'s Dead', 3, 2, 'Yes', 'Yes', 'No', 27, 9, 2010, 'Beckett and Castle search for a psychic\'s killer while debating the existence of extrasensory abilities.', 'Y', 'N', 8.1),
	('Castle', 'Under The Gun', 3, 3, 'Yes', 'Yes', 'No', 4, 10, 2010, 'When a coded document attracts Castle\'s attention, Beckett must steer the case back to the violent felons who populated their victim\'s world; when Beckett\'s ex-partner arrives, Castle must watch the relationship become romantic.', 'Y', 'N', 8.4),
	('Castle', 'Punked', 3, 4, 'Yes', 'Yes', 'No', 11, 10, 2010, 'Castle and Beckett look into the murder of a young mathematician gunned down with a 200-year-old bullet, sparking some wild theories by Castle about a time-traveling killer. When their investigation uncovers a tricked-out DeLorean and a suspect in Victorian clothing, is it possible Castle\'s crazy idea has some validity? This winding tale twists through the towers of Wall Street and into the world of a secret steampunk society that embraces the romance and simplicity of the past, while coupling it with the hope and promise of the future.', 'Y', 'N', 8.6),
	('Castle', 'Anatomy Of A Murder', 3, 5, 'Yes', 'Yes', 'No', 18, 10, 2010, 'An unknown woman falls out of a casket along with the original deceased when pallbearers lose control of the casket at a funeral; the investigation takes Beckett and Castle into the world of amorous, bed-hopping physicians.', 'Y', 'N', 8.4),
	('Castle', '3XK', 3, 6, 'Yes', 'Yes', 'No', 25, 10, 2010, 'When a beautiful woman is found dead in an alley, all clues point to her being a victim of the notorious Triple Killer. The Triple Killer, or 3XK, terrorized New York City four years ago, then mysteriously disappeared. Now he\'s back. In a deadly battle of wits, Castle and Beckett race against time to stop 3XK before he claims his next victims.', 'Y', 'N', 8.9),
	('Castle', 'Almost Famous', 3, 7, 'Yes', 'Yes', 'No', 1, 11, 2010, 'An \'Officer Down\' call turns out to be a male stripper dressed like a cop. Castle and Beckett explore the world of male strip clubs and struggling actors, all people in pursuit of fame. They need to determine if the murder was because of the victim\'s dreams of stardom or something more sinister.', 'Y', 'N', 7.8),
	('Castle', 'Murder Most Fowl', 3, 8, 'Yes', 'Yes', 'No', 8, 11, 2010, 'Castle and Beckett investigate the murder of an NYC subway worker found shot in Central Park. But, while investigating the murder they uncover the abduction of a young boy as well. The team must determine the motives behind the high stakes kidnapping in order to save the young boy\'s life.', 'Y', 'N', 8.2),
	('Castle', 'Close Encounters Of The Murderous Kind', 3, 9, 'Yes', 'Yes', 'No', 15, 11, 2010, 'Castle and Beckett investigate the murder of the owner of a historic magic shop found dead in a Houdini\'s water torture tank.', 'Y', 'N', 8.6),
	('Castle', 'Last Call', 3, 10, 'Yes', 'Yes', 'No', 6, 12, 2010, 'Castle and Beckett investigate the murder of a dockworker turned bar owner who\'s body is found floating in the East River. In the process of the investigation they uncover a secret buried since the days of Prohibition. ', 'Y', 'N', 8.6),
	('Castle', 'Nikki Heat', 3, 11, 'Yes', 'Yes', 'No', 3, 1, 2011, 'When Castle\'s novel \'\'Heat Wave\'\' becomes a movie, actress Natalie Rhodes accepts Beckett\'s invitation to visit and learn about the character she will play; Natalie observes Castle and Beckett\'s investigation of the murder of a matchmaker.', 'Y', 'N', 9),
	('Castle', 'Poof! You\'re Dead', 3, 12, 'Yes', 'Yes', 'No', 10, 1, 2011, 'Castle and Beckett investigate the murder of the owner of a historic magic shop found dead in a Houdini\'s water torture tank.', 'Y', 'N', 8.4),
	('Castle', 'Knockdown', 3, 13, 'Yes', 'Yes', 'No', 24, 1, 2011, 'When the detective who investigated Beckett\'s mother\'s murder is shot before Beckett\'s eyes before he can give her new evidence in the case, Beckett\'s old wounds are reopened. The investigation of the detective\'s death leads the team to an old scheme which may provide the answer to why Beckett\'s mother was murdered and who ordered it. Beckett and Castle\'s relationship takes a new turn.', 'Y', 'N', 9.3),
	('Castle', 'Lucky Stiff', 3, 14, 'Yes', 'Yes', 'No', 7, 2, 2011, 'The brutal murder of a lottery winner has Castle and Beckett up to their eyeballs in suspects, envious and angered by the victim\'s sudden move from the poorhouse to the penthouse. As the precinct buzzes with fantasies of what our cops would do if they won the lottery, Martha struggles with the reality of such a decision when she suddenly inherits money she feels she doesn\'t deserve.', 'Y', 'N', 8.2),
	('Castle', 'The Final Nail', 3, 15, 'Yes', 'Yes', 'No', 14, 2, 2011, 'Castle and Beckett find themselves on opposite sides of the case when Castle\'s old school friend emerges as the prime suspect in his own wife\'s murder. As they work to solve the crime, Castle comes to realize that one of two terrible things must be true... Either Detective Beckett is about to arrest an innocent man for murder, or his old friend is a cold-blooded killer.', 'Y', 'N', 8.3),
	('Castle', 'Set Up', 3, 16, 'Yes', 'Yes', 'No', 21, 2, 2011, 'Castle and Beckett investigate the apparent robbery-homicide of a New York cab driver, only to discover that the victim was involved in a mysterious conspiracy with unimaginable consequences. As the stakes continue to rise, hard-charging federal agent Mark Fallon takes over the investigation. Together, Fallon, Beckett and Castle must race to unmask the truth about the victim before it\'s too late.', 'Y', 'N', 8.9),
	('Castle', 'Countdown', 3, 17, 'Yes', 'Yes', 'No', 28, 2, 2011, 'With time running out, Castle and Beckett must put aside their differences with Agent Fallon to avert a city-wide catastrophe. ', 'Y', 'N', 9),
	('Castle', 'One Life To Loose', 3, 18, 'Yes', 'Yes', 'No', 21, 3, 2011, 'A murder has been committed on the set of \'Temptation Lane\', one of New York\'s longest running soap operas.', 'Y', 'N', 8.1),
	('Castle', 'Law And Murder', 3, 19, 'Yes', 'Yes', 'No', 28, 3, 2011, 'During the high profile trial of a murdered socialite, a juror tumbles out of the jury box....dead.', 'Y', 'N', 8.4),
	('Castle', 'Slice Of Death', 3, 20, 'Yes', 'Yes', 'No', 4, 4, 2011, 'When a reporter is found dead inside a restaurant\'s pizza oven, Beckett and Castle go to work on solving the case. They must figure out if his story \'The Pizza Wars\' is what got him killed or if there\'s something more to the story.', 'Y', 'N', 8.2),
	('Castle', 'The Dead Pool', 3, 21, 'Yes', 'Yes', 'No', 11, 4, 2011, 'When a champion swimmer and Olympic hopeful is found dead in a training pool, Castle & Beckett dive in to investigate his murder, and uncover myriad secrets that might have led to his death.', 'Y', 'N', 8),
	('Castle', 'To Love And Die In L.A', 3, 22, 'Yes', 'Yes', 'No', 2, 5, 2011, 'While investigating the shooting death of her ex-partner in New York, Beckett comes to believe the suspect has fled to Los Angeles. Against orders, she travels to L.A., going renegade to track down the killer, with Castle unexpectedly along for the ride. As they dig deeper into the motives, they uncover a trail that leads from a rooftop pool in Hollywood to the sandy beach of Santa Monica. Along the way, they visit the set of the \'Heat Wave\' movie (based on Castle\'s book) and enlist the cast to help break the case. But as they get closer to apprehending the killer, Castle begins to wonder whether Beckett is out for justice or revenge. ', 'Y', 'N', 8.8),
	('Castle', 'Pretty Dead', 3, 23, 'Yes', 'Yes', 'No', 9, 5, 2011, 'During rehearsal for \'Baron\'s All-American Beauty Pageant\', the contestants are shocked to discover the body of Miss Illinois - strangled, but by whom? As Castle and Beckett delve into the cut-throat competition of the pageant world, they learn that a number suspects had motive for murder, including jealous fellow contestants, the pageant\'s larger-than-life millionaire sponsor, Victor Baron, and the show\'s host -- hedonistic TV personality, Bobby Stark.', 'Y', 'N', 7.9),
	('Castle', 'Knockout', 3, 24, 'Yes', 'Yes', 'No', 16, 5, 2011, 'Kate Beckett\'s investigation into her mother\'s death is reactivated when Hal Lockwood - a professional hitman with knowledge of Beckett\'s mother\'s murder - stages a spectacular escape during a court hearing. As police launch a manhunt for Lockwood, Castle and the team uncover evidence of a deeper conspiracy involving a mysterious figure with law enforcement connections who is linked to both Lockwood\'s escape and the killing of Johanna Beckett. The search for Lockwood and the quest to identify his co-conspirator leads to a shocking and deadly conclusion.', 'Y', 'N', 9.4),
	('Castle', 'Rise', 4, 1, 'Yes', 'Yes', 'No', 19, 9, 2011, 'Detective Beckett struggles to survive. Castle tries to identify the shooter. Ryan and Esposito try to adjust to the new captain.', 'Y', 'N', 8.8),
	('Castle', 'Heroes And Villains', 4, 2, 'Yes', 'Yes', 'No', 26, 9, 2011, 'Castle and Beckett suspect a costume-clad vigilante is responsible for the mysterious murder of an ex-con.', 'Y', 'N', 8.7),
	('Castle', 'Head Case', 4, 3, 'Yes', 'Yes', 'No', 3, 10, 2011, 'A murder scene complete with lots of blood but no victim and high tech life-extension science are all part of the investigation as Castle and Beckett try to solve a murder without a body. Meanwhile, Alexis waits to hear news about her application to Stanford', 'Y', 'N', 8),
	('Castle', 'Kick The Ballistics', 4, 4, 'Yes', 'Yes', 'No', 10, 10, 2011, 'A young woman will be murdered and the murder weapon will be Detective Ryan\'s old service piece. Castle, Beckett, Ryan and Esposito must rush against time to solve the murder, track down and retrieve Ryan\'s gun before the killer strikes again', 'Y', 'N', 8.5),
	('Castle', 'Eye Of The Beholder', 4, 5, 'Yes', 'Yes', 'No', 17, 10, 2011, 'A wealthy museum patron is a suspect when a valuable sculpture is stolen. Castle and Beckett investigate the theft with the help of an insurance investigator who sets her sights on Castle.', 'Y', 'N', 8.6),
	('Castle', 'Demons', 4, 6, 'Yes', 'Yes', 'No', 24, 10, 2011, 'While doing some investigative work at a New York mansion, a prominent ghost hunter is murdered. Castle and Beckett must figure out if paranormal activities are to blame.', 'Y', 'N', 8.6),
	('Castle', 'Cops And Robbers', 4, 7, 'Yes', 'Yes', 'No', 31, 10, 2011, 'A crew of bank robbers disguised as classic television doctors take hostages which include Castle and Martha. But things are complicated by the fact that Beckett\'s on the outside having her every move scrutinized by a hostage negotiator and Castle\'s on the inside with information that the hostages are just a distraction for a more ominous plan.', 'Y', 'N', 9.2),
	('Castle', 'Heartbreak Hotel', 4, 8, 'Yes', 'Yes', 'No', 7, 11, 2011, 'During the investigation of the murder of an Atlantic City casino owner at an abandoned warehouse, strong leads emerge for the team in both New York and Atlantic City. As Beckett and Capt. Gates work the New York leads together, Castle naturally chooses to join the detectives for the road trip to \'America\'s Playground\', hoping to help solve the case while throwing an impromptu bachelor party for Ryan.', 'Y', 'N', 8),
	('Castle', 'Kill Shot', 4, 9, 'Yes', 'Yes', 'No', 21, 11, 2011, 'A sniper on a killing spree is terrorizing New York City. With the clock ticking down to the next murder and nothing to go on except a killer with no apparent motive but to instill terror, this could prove the team\'s toughest case yet. The hunt is made even more complicated when Beckett begins to experience increasingly strong moments of PTSD - moments she tries hard to hide from Castle and the detectives. ', 'Y', 'N', 8.8),
	('Castle', 'Cuffed', 4, 10, 'Yes', 'Yes', 'No', 5, 12, 2011, 'When Castle and Beckett wake up in bed, handcuffed together, in a locked room with no memory of how they got there, they must piece together the mystery of where they are and why, all while trying to escape. But as the two of them adjust to being shackled together, what\'s the biggest threat they face... the people who abducted them or each other? Meanwhile, Ryan, Esposito and Gates are left to investigate their disappearance in a case where all is not what it seems. ', 'Y', 'N', 9),
	('Castle', 'Till Death Do Us Part', 4, 11, 'Yes', 'Yes', 'No', 9, 1, 2012, 'When a lothario is killed, Castle and Beckett suspect that the victim\'s mysterious double life holds the key to his murder. Their investigation leads to a shocking twist that threatens to disrupt Ryan\'s wedding with Jenny', 'Y', 'N', 8.5),
	('Castle', 'Dial M For Mayor', 4, 12, 'Yes', 'Yes', 'No', 16, 1, 2012, 'It was longtime Castle friend Mayor Weldon\'s political clout that allowed Castle to partner up with Beckett. But now, when a woman is found dead in a car that traces back to the Mayor\'s motor pool, that partnership comes under fire as the scandal surrounding the investigation threatens to bring down Weldon\'s administration.', 'Y', 'N', 8.4),
	('Castle', 'An Embarrassment Of Bitches', 4, 13, 'Yes', 'Yes', 'No', 23, 1, 2012, 'When a famous dog trainer is killed, the investigation keeps coming back to charismatic reality TV star Kay Cappuccio. Kay, a favorite of tabloids and gossip websites the world over, has achieved stardom without possessing any discernible skill or talent. But there seems to be more to her story than she is letting on -- does that include murder?', 'Y', 'N', 8.3),
	('Castle', 'The Blue Butterfly', 4, 14, 'Yes', 'Yes', 'No', 6, 2, 2012, 'When Castle and Beckett investigate the killing of a treasure hunter, they discover the case is linked to a mysterious homicide from 1947 involving a hard-boiled private detective. Castle realizes the only way to solve the present-day murder is to solve the murder from the past. The 1947 case comes to life through stylized flashbacks, featuring Castle as the private eye and Beckett as a femme fatale. ', 'Y', 'N', 9),
	('Castle', 'Pandora', 4, 15, 'Yes', 'Yes', 'No', 13, 2, 2012, 'Castle and Beckett work with the CIA as they hunt a killer who\'s connected to an international conspiracy, and the case reunites Castle and a female CIA agent with whom he shares a past.', 'Y', 'N', 8.9),
	('Castle', 'Linchpin', 4, 16, 'Yes', 'Yes', 'No', 20, 2, 2012, 'Castle and Beckett try to stop a series of events that could lead the U.S. into a war, and their efforts continue to put Castle in CIA agent Sophia Conrad\'s orbit.', 'Y', 'N', 8.8),
	('Castle', 'Once Upon A Crime', 4, 17, 'Yes', 'Yes', 'No', 27, 2, 2012, 'When a woman dressed as Red Riding Hood is found dead in the woods with claw marks covering her body, and soon after a murdered Snow White is discovered with a poison apple in her hand, Castle & Beckett find themselves on a Grimm hunt to catch a fairytale killer before he kills again. But nothing is as it seems in a case filled with deceit, betrayal, secrets and murder', 'Y', 'N', 8.3),
	('Castle', 'A Dance With Death', 4, 18, 'Yes', 'Yes', 'No', 19, 3, 2012, 'When Odette Morton, a contestant on the hit competition show A Night Of Dance, is found murdered in her dressing room, Castle and Beckett must navigate the case\'s many twists and twirls without stepping on each other\'s toes. But as they delve into Odette\'s past, they discover that this reality starlet was harboring a shocking secret that may have led to her death', 'Y', 'N', 7.8),
	('Castle', '47 Seconds', 4, 19, 'Yes', 'Yes', 'No', 26, 3, 2012, 'When a bomb explodes at a protest rally killing five people, Castle and Beckett realize the key to solving the case is to reconstruct the 47 seconds prior to the explosion. Using video and witness accounts, they uncover the shocking truth about who planted the bomb.', 'Y', 'N', 8.7),
	('Castle', 'The Limey', 4, 20, 'Yes', 'Yes', 'No', 2, 4, 2012, 'A devilishly handsome detective from Scotland Yard, Simon Hunt, teams up with Castle & Beckett to find the person responsible for the murder of his friend\'s daughter. Also, Nigel Wyndham, the Deputy General at the British Consulate whom Castle & Beckett suspect is up to more than just ambassadorial balls and diplomatic luncheons. Meanwhile, Lanie convinces Beckett that she needs to make a move on Castle before it is too late.', 'Y', 'N', 8.1),
	('Castle', 'Headhunters', 4, 21, 'Yes', 'Yes', 'No', 16, 4, 2012, 'With tensions rising between Castle and Beckett, Castle finds himself a new partner -- Detective Ethan Slaughter , a tough and colorful cop from the city\'s gang unit. But Castle gets more than he bargained for when Slaughter shows him a grittier side of police work that puts Castle in the line of fire like never before', 'Y', 'N', 8.7),
	('Castle', 'Undead Again', 4, 22, 'Yes', 'Yes', 'No', 30, 4, 2012, 'When Castle and Beckett investigate the murder of a man with human bite marks on his body, Castle\'s wild theories start flying. But none are as wild as what their only witness insists happened - a Zombie attack. As the evidence pointing towards an undead assailant piles up, the team plunges into New York\'s Zombie subculture to find the killer and bring him in -- dead, undead or alive ', 'Y', 'N', 8.9),
	('Castle', 'Always', 4, 23, 'Yes', 'Yes', 'No', 7, 5, 2012, 'When the murder of an Army veteran puts Beckett on the trail of the man who shot her, Castle must decide how much he\'s willing to sacrifice to keep her safe. As secrets are revealed and feelings are put on the table, the lives of the detectives at the 12th Precinct may never be the same.', 'Y', 'N', 9.5),
	('Castle', 'After The Storm', 5, 1, 'Yes', 'Yes', 'No', 24, 9, 2012, 'After four seasons of \'will they\' or \'won\'t they\', Richard Castle and Kate Beckett finally gave in to their feelings for each other. Season 5 picks up on the proverbial morning after, with Castle and Beckett facing new questions -- Was this a one-time fling, or are they now a couple? But before they find the answers, they must take on the forces responsible for Beckett\'s mother\'s murder that now threaten Kate Beckett\'s life.', 'Y', 'N', 9.2),
	('Castle', 'Cloudy With A Chance Of Murder', 5, 2, 'Yes', 'Yes', 'No', 1, 10, 2012, 'On Beckett\'s first day back from her suspension, she and Castle are thrown into the salacious world of local TV news when WHNY\'s veteran weather girl is found dead. As if navigating an industry full of backstabbing and ruthless ambition weren\'t difficult enough, they have to do it while hiding their new relationship from their coworkers.', 'Y', 'N', 8.5),
	('Castle', 'Secret\'s Safe With Me', 5, 3, 'Yes', 'Yes', 'No', 8, 10, 2012, 'When a young woman is mysteriously murdered, Beckett and Castle discover her death may be linked to a repossessed storage unit up for auction. Was the unit connected to her death? Was something inside it worth killing for? The investigation leads Castle and Beckett to colorful Storage Wars-like treasure seekers and Manhattan socialites as they uncover the shocking truth.', 'Y', 'N', 8.6),
	('Castle', 'Murder, He Wrote', 5, 4, 'Yes', 'Yes', 'No', 15, 10, 2012, 'Castle and Beckett\'s plans for a romantic weekend in the Hamptons are interrupted when a dying man stumbles into Castle\'s backyard, collapsing into his pool. Unable to escape the lure of the investigation they join up with the small town\'s well-intentioned, but inexperienced sheriff to find the killer,', 'Y', 'N', 9),
	('Castle', 'Probable Cause', 5, 5, 'Yes', 'Yes', 'No', 29, 10, 2012, 'While investigating a shocking ritualistic murder, Beckett and her team uncover surprising evidence linking Castle to the killing. As the evidence against him mounts, loyalties are tested. And when surprising revelations come to light, Beckett begins to wonder how well she really knows her new lover and partner of four years.', 'Y', 'N', 9.3),
	('Castle', 'The Final Frontier', 5, 6, 'Yes', 'Yes', 'No', 5, 11, 2012, 'When a body is found at a sci-fi convention, Castle and Beckett are warped into the heart of fandom -- a world of egotistic celebrities, diehard costumed fans and enough drama for two galaxies.', 'Y', 'N', 8.9),
	('Castle', 'Swan Song', 5, 7, 'Yes', 'Yes', 'No', 12, 11, 2012, 'When the lead guitarist of a rock band is murdered, the documentary crew that were following the band turn their cameras on Castle, Beckett and the team as they try to solve the case. The result is a documentary style episode of \'Castle\', which offers us a unique glimpse at our characters as they navigate a world that goes far beyond the rock & roll stage.', 'Y', 'N', 8),
	('Castle', 'After Hours', 5, 8, 'Yes', 'Yes', 'No', 19, 11, 2012, 'In the aftermath of a disastrous \'Meet the Parents\' dinner, a bickering Castle and Beckett are sent to retrieve the only witness to a murder, but they get ambushed and are forced to take the witness on the run. Stranded in the middle of the night in a bad part of town, with no phone, badge or gun, Castle and Beckett must find a way to protect him from a team of mobsters -- that is, if they don\'t kill each other first.', 'Y', 'N', 8.4),
	('Castle', 'Secret Santa', 5, 9, 'Yes', 'Yes', 'No', 3, 12, 2012, 'When a bearded, rotund man in a red Santa suit with an ID reading Kris Kringle falls from the sky in Central Park, Castle and Beckett are on the hunt to find the person who killed Santa. But everything isn\'t holiday cheer, as they discover St. Nick may have been more naughty than nice. Meanwhile, Castle and Beckett prepare for their first Christmas together.', 'Y', 'N', 8.4),
	('Castle', 'Significant Others', 5, 10, 'Yes', 'Yes', 'No', 7, 1, 2013, 'When a powerful divorce attorney who only represented women is murdered, Castle and Beckett are confronted with a plethora of angry ex-husbands, any one of whom could be the murderer. Meanwhile, Castle\'s ex-wife Meredith, moves into the loft to take care of Alexis while she recovers from Mono, and to make matters worse, Beckett is also forced to move in while her apartment is being fumigated, causing tension, humor and more than a little awkwardness', 'Y', 'N', 8.4),
	('Castle', 'Under The Influence', 5, 11, 'Yes', 'Yes', 'No', 14, 1, 2013, 'When an up and coming DJ is killed at a pop star\'s album release party, Beckett and Castle must dive into the raucous world of New York\'s music industry. Then, when the investigation leads to a troubled teenager, Esposito takes the kid under his wing, hoping to put him on the right track before it\'s too late.', 'Y', 'N', 7.8),
	('Castle', 'Death Gone Crazy', 5, 12, 'Yes', 'Yes', 'No', 21, 1, 2013, 'When Beau Randolf, the founder of hit adult video franchise \'College Girls Gone Crazy,\' is murdered, Castle and Beckett are confronted with a lengthy list of husbands, fathers and ex-college girls who all have motive. So to find the killer, they must delve deep into the victim\'s life, where they find surprises at every turn. Also Alexis starts a video blog, but Castle is not happy that personal and intimate details about her life are being made public.', 'Y', 'N', 7.7),
	('Castle', 'Recoil', 5, 13, 'Yes', 'Yes', 'No', 4, 2, 2013, 'While investigating the murder of a young woman, Castle and Beckett find evidence that links her death with Senator William H. Bracken (Jack Coleman), the man responsible for Beckett\'s mother\'s murder. Determined to finally bring Bracken to justice, Beckett soon realizes that things are far more complicated than they seem', 'Y', 'N', 8.5),
	('Castle', 'Reality Star Struck', 5, 14, 'Yes', 'Yes', 'No', 11, 2, 2013, 'Castle & Beckett get an up-close-and-personal view of a \'Real Housewives\'-esque reality TV series, \'The Wives of Wall Street\', when they investigate the murder of the show\'s rising young star. Meanwhile, Castle\'s attempt to give Beckett a Valentine\'s Day gift goes horribly wrong.', 'Y', 'N', 8.1),
	('Castle', 'Target', 5, 15, 'Yes', 'Yes', 'No', 18, 2, 2013, 'In the first of a two-episode story arc, Castle and Beckett begin a murder investigation that also exposes a plot to kidnap the daughter of a wealthy Middle Eastern businessman. FBI Agent Harris, an even-keeled professional is brought in to help find the kidnappers.', 'Y', 'N', 9.3),
	('Castle', 'Hunt', 5, 16, 'Yes', 'Yes', 'No', 25, 2, 2013, 'In the powerful conclusion of a two-episode story arc, when the FBI fails to get his daughter back, Castle takes matters into his own hands, reaching out to a shadowy fixer to help him recover Alexis. But Castle soon learns that his daughter\'s kidnapping may be part of an even more sinister agenda.', 'Y', 'N', 9.4),
	('Castle', 'Scared To Death', 5, 17, 'Yes', 'Yes', 'No', 18, 3, 2013, 'When a young woman appears to have literally been scared to death three days after watching a \'haunted\' DVD, Castle and Beckett delve into one of their creepiest cases yet. To make matters worse, Castle becomes convinced that he too is marked for death when he accidentally watches the cursed video.', 'Y', 'N', 8.5),
	('Castle', 'The Wild Rover', 5, 18, 'Yes', 'Yes', 'No', 25, 3, 2013, 'When a man is found dead in an industrial cake mixer, Castle and Beckett trace the murder to an Irish gang in Staten Island and a beautiful bar owner named Siobhan O\'Doul. Much to everyone\'s surprise, Detective Ryan has a complicated history with Siobhan and the Staten Island crime family from his days working undercover in narcotics. When the case hits a dead end, Ryan must go back undercover to expose the killer, complicating his relationship with his wife.', 'Y', 'N', 8.7),
	('Castle', 'The Lives Of Others', 5, 19, 'Yes', 'Yes', 'No', 1, 4, 2013, 'In the show\'s 100th episode, Castle finds himself in the unfortunate position of NOT being able to work a case. While he\'s holed up in the loft with a broken leg, Beckett goes off to investigate the death of an IRS agent without him, leaving Castle miserable and bored. But when he thinks he witnesses the murder of a young woman in the apartment across the street, he is thrown into a \'Rear Window\'-esque murder mystery that hits much too close to home.', 'Y', 'N', 9.3),
	('Castle', 'The Fast And The Furriest', 5, 20, 'Yes', 'Yes', 'No', 15, 4, 2013, 'When Castle and Beckett find giant footprints at the site of a vicious murder, the team is forced to confront the unlikely theory that Bigfoot is the killer. But as they trek into the world of primate research, big game hunting and mythological creatures, they realize that finding the man (or beast) responsible may put them on the endangered species list.', 'Y', 'N', 7.7),
	('Castle', 'The Squab And The Quail', 5, 21, 'Yes', 'Yes', 'No', 22, 4, 2013, 'When Beckett is assigned to protect Erik Vaughn, a charming billionaire entrepreneur whose life is in danger, she\'s forced to reflect on her relationship with Castle which has begun to plateau. Meanwhile, consumed with jealousy, Castle goes to extraordinary lengths to solve the case and separate the two of them.', 'Y', 'N', 8),
	('Castle', 'Still', 5, 22, 'Yes', 'Yes', 'No', 29, 4, 2013, 'Beckett\'s life is on the line when she steps on a pressure sensitive bomb. While the team searches for a way to disarm the explosive, Castle distracts Beckett by arguing with her about who fell for whom first.', 'Y', 'N', 8.8),
	('Castle', 'The Human Factor', 5, 23, 'Yes', 'Yes', 'No', 6, 5, 2013, 'When Homeland Security inexplicably seals the crime scene of a car bombing, Castle and Beckett find themselves with two mysteries on their hands: who murdered the victim, a government whistleblower, and why are federal agents trying to take over the case? The plot thickens when they discover that the victim wasn\'t killed by a car bomb but by a missile from a military drone.', 'Y', 'N', 8.1),
	('Castle', 'Watershed', 5, 24, 'Yes', 'Yes', 'No', 13, 5, 2013, 'In the season finale, an interview with a high-profile federal law enforcement agency forces Beckett to reconsider what she wants out of her job and out of her relationship with Castle. Meanwhile, the body of a young woman is found floating inside the water tank of a skid row flop house, but as the team investigate, they discover that her final resting place is just one of many strange things about her death.', 'Y', 'N', 8.5),
	('Castle', 'Valkyrie', 6, 1, 'Yes', 'Yes', 'No', 23, 9, 2013, 'Last season ended with Beckett wrestling over whether to take a high-profile job in DC -- a dilemma made more complicated when Castle proposed to her. Castle and Beckett will deal with the consequences of their decisions against the backdrop of a high-stakes investigation.', 'Y', 'N', 8.6),
	('Castle', 'Dreamworld', 6, 2, 'Yes', 'Yes', 'No', 30, 9, 2013, 'Continuing from the season premiere episode, Beckett races against time to find a stolen toxin capable of killing tens of thousands of people. To make matters worse, Castle was exposed, leaving him with less than 24 hours to live.', 'Y', 'N', 8.1),
	('Castle', 'Need To Know', 6, 3, 'Yes', 'Yes', 'No', 7, 10, 2013, 'With Beckett still in D.C., Castle and the boys investigate the murder of former child star Charlie Reynolds, who rose to fame playing the lovable nerd on an early 90s High School sitcom. But the case takes a turn for the strange when Agents Beckett and McCord arrive from Washington to take over the investigation, creating competitive tension in the precinct. Meanwhile, Castle has to contend with a new face at the 12th, NYPD Detective Frank \'Sully\' Sullivan.', 'Y', 'N', 8.1),
	('Castle', 'Number One Fan', 6, 4, 'Yes', 'Yes', 'No', 14, 10, 2013, 'A desperate young murder suspect, Emma Briggs, takes hostages at gunpoint then mysteriously insists that she will only negotiate with one person: Richard Castle.', 'Y', 'N', 8.5),
	('Castle', 'Time Will Tell', 6, 5, 'Yes', 'Yes', 'No', 21, 10, 2013, 'A grisly murder investigation leads Castle and Beckett to a suspect who claims he\'s traveled back in time to stop terrible events from unfolding, events that will change the course of human history. Is he simply a deluded killer, or is it possible that he\'s telling the truth?', 'Y', 'N', 9),
	('Castle', 'Get A Clue', 6, 6, 'Yes', 'Yes', 'No', 28, 10, 2013, 'Castle and Beckett investigate the bizarre murder of a young woman who was found ritually posed. When the team finds a collection of strange symbols in her apartment and the prime suspect turns out to be a mysterious monk, Castle becomes convinced they\'ve stumbled onto a \'Da Vinci Code\' style conspiracy. Meanwhile, Castle tries to come to grips with the fact that Alexis and Pi have moved in together.', 'Y', 'N', 8),
	('Castle', 'Like Father, Like Daughter', 6, 7, 'Yes', 'Yes', 'No', 4, 11, 2013, 'Alexis enlists Castle\'s help on an Innocence Review case to prove that a death row inmate, Frank Henson, was wrongly convicted. With only 72 hours left before his execution, Castle and Alexis (with help from Beckett) urgently investigate the original murder, only to uncover explosive secrets that may seal Frank\'s fate.', 'Y', 'N', 8.6),
	('Castle', 'A Murder Is Forever', 6, 8, 'Yes', 'Yes', 'No', 11, 11, 2013, 'When a famed relationship therapist is murdered, it appears that her access to the secrets of her elite and powerful clients led to her death. But when Castle and Beckett discover the victim was in possession of a rare object worth millions of dollars, they realize that this case may be even more complicated  and dangerous  than they thought.', 'Y', 'N', 7.9),
	('Castle', 'Disciple', 6, 9, 'Yes', 'Yes', 'No', 18, 11, 2013, 'Castle and Beckett arrive at a crime scene to discover that the female victim bears a shocking resemblance to Medical Examiner Lanie Parish. As the team tries to make sense of this mystery, they realize the killer may be targeting detectives of the 12th Precinct. Dr. Kelly Nieman, an exclusive Manhattan cosmetic surgeon who draws Castle and Beckett\'s interest because of her connection to the victim.', 'Y', 'N', 9.1),
	('Castle', 'The Good, The Bad & The Baby', 6, 10, 'Yes', 'Yes', 'No', 25, 11, 2013, 'A bleeding man stumbles into a church, but just before dying, he hands a mysterious bundle to the priest. When the bundle turns out to be a smiling baby boy, Castle and Beckett find themselves accidental nannies to the newborn. But when they determine the baby and the victim were not related, they discover that finding his rightful parents may be just as hard as solving the murder.', 'Y', 'N', 8.5),
	('Castle', 'Under Fire', 6, 11, 'Yes', 'Yes', 'No', 6, 1, 2014, 'When Castle and Beckett discover that the victim of a building fire was actually shot to death, they get on the trail of a serial arsonist turned murderer. Meanwhile, Ryan\'s wife, Jenny, goes into labor, but disaster threatens to ruin the joyous moment', 'Y', 'N', 8.8),
	('Castle', 'Deep Cover', 6, 12, 'Yes', 'Yes', 'No', 13, 1, 2014, 'The murder of a young video store clerk takes a strange turn when the team discovers his past history as a high-level hacker. But it\'s nothing compared to the shock Castle receives when their investigation leads them straight to his father, Jackson Hunt.', 'Y', 'N', 8.7),
	('Castle', 'Limelight', 6, 13, 'Yes', 'Yes', 'No', 20, 1, 2014, 'When a rising young pop star is found dead in an alley, Castle and Beckett delve into the victim\'s out-of-control hard-partying lifestyle, but as they dig deeper, a shocking revelation threatens to rock their investigation.', 'Y', 'N', 8.3),
	('Castle', 'Dressed To Kill', 6, 14, 'Yes', 'Yes', 'No', 3, 2, 2014, 'When the assistant to Modern Fashion Magazines dictatorial editor Matilda King is found murdered, Castle and Beckett are thrust into the glitzy, ruthless world of high fashion in their search for the killer. Meanwhile Becketts history in the modelling world gets her access to a very special wedding surprise.', 'Y', 'N', 8.1),
	('Castle', 'Smells Like Teen Spirit', 6, 15, 'Yes', 'Yes', 'No', 17, 2, 2014, 'When the assistant to Modern Fashion Magazines dictatorial editor Matilda King is found murdered, Castle and Beckett are thrust into the glitzy, ruthless world of high fashion in their search for the killer. Meanwhile Becketts history in the modelling world gets her access to a very special wedding surprise.', 'Y', 'N', 8.5),
	('Castle', 'Room 147', 6, 16, 'Yes', 'Yes', 'No', 24, 2, 2014, 'When a guilt-ridden young woman confesses to the murder of a struggling actor -- knowing details only the killer could know -- Beckett and Castle seem to have an open-and-shut case, until they uncover proof that their suspect couldnt possibly be the killer. When a second person confesses, equally convinced they committed the murder, the team realizes the case is far more mysterious than they thought.', 'Y', 'N', 8.5),
	('Castle', 'In The Belly Of The Beast', 6, 17, 'Yes', 'Yes', 'No', 3, 3, 2014, 'Beckett is recruited to assist on a Narcotics investigation, but a routine mission turns deadly when an undercover operation goes array. To survive, Beckett must engage in a battle of wits against some of the most dangerous men in the New York underworld  including a powerful enemy from her past', 'Y', 'N', 9),
	('Castle', 'The Way Of The Ninja', 6, 18, 'Yes', 'Yes', 'No', 17, 3, 2014, 'When a Japanese ballet dancer is mysteriously murdered, Castle and Beckett\'s investigation into her secret life uncovers evidence that she was killed by a ninja, and now that ninja is coming after them.', 'Y', 'N', 8.5),
	('Castle', 'The Greater Good', 6, 19, 'Yes', 'Yes', 'No', 24, 3, 2014, 'Castle and Beckett investigate the murder of a Wall Street trader, but the case takes a shocking turn when the they discover the victim was an undercover informant for the U.S. Attorney\'s office. To complicate matters further, the U.S. attorney involved is Elizabeth Weston, Captain Gates\' estranged sister.', 'Y', 'N', 8.1),
	('Castle', 'That \'70s Show', 6, 20, 'Yes', 'Yes', 'No', 21, 4, 2014, 'When construction workers find the body of an infamous New York mobster who disappeared in the seventies, Beckett and Castle try to solve this three decade-old Mafia hit. Unfortunately, their only witness is a man who thinks its still the 1970s, so to uncover what he knows, they must play into his delusion, and party like its the last days of disco.', 'Y', 'N', 8.4),
	('Castle', 'Law & Boarder', 6, 21, 'Yes', 'Yes', 'No', 28, 4, 2014, 'When an up-and-coming professional skateboarder is gunned down by a mysterious motorcyclist, Castle and Beckett are thrust into the world of extreme sports, where the death defying stunts arent the only thing thats dangerous.', 'Y', 'N', 7.6),
	('Castle', 'Veritas', 6, 22, 'Yes', 'Yes', 'No', 5, 5, 2014, 'A secret investigation conducted by Beckett related to her mother\'s murder goes awry when a man she has been surveilling is killed. When evidence links Beckett to the victim, she and Castle become the targets of a manhunt that puts both of them in grave danger.', 'Y', 'N', 9.3),
	('Castle', 'For Better Or For Worse', 6, 23, 'Yes', 'Yes', 'No', 12, 5, 2014, 'Castle and Beckett\'s long-awaited wedding is almost here, but when a shocking surprise threatens to ruin the big day, they are sent on a wild mission filled with masked men, angry bikers and a charming ne\'er-do-well from Beckett\'s past.', 'Y', 'N', 7.9),
	('Castle', 'Driven', 7, 1, 'Yes', 'Yes', 'Yes', 29, 9, 2014, 'As Richard Castle drove to his much-anticipated nuptials, an ominous black SUV bore down on him. Meanwhile, after waiting in vain for Castle to arrive at the wedding, Beckett was called to an accident scene to find Castle\'s car in a ravine, engulfed in flames. Who or what caused the car crash? Is there any way Castle could have survived? The episode will pick-up at the scene of that accident, right where the finale left off, in a premiere that promises to put Beckett through the toughest case of her career', 'Y', 'N', 8.3),
	('Castle', 'Montreal', 7, 2, 'Yes', 'Yes', 'Yes', 6, 10, 2014, 'While the team investigates the murder of a toy company CEO, Castle uncovers a lead to his mysterious disappearance, launching him into a dangerous investigation of his own.', 'Y', 'N', 8.4),
	('Castle', 'Clear And Present Danger', 7, 3, 'Yes', 'Yes', 'Yes', 13, 10, 2014, 'When a pool shark is murdered by an unseen force, Castle and Becket uncover evidence that the killer may have paranormal powers. Meanwhile, Castle and Beckett attempt to get their lives back to normal following his disappearance.', 'Y', 'N', 8.2),
	('Castle', 'Child\'s Play', 7, 4, 'Yes', 'Yes', 'Yes', 20, 10, 2014, 'When an ice cream vender is shot, evidence leads Beckett and Castle to believe that an unknown second-grader may have vital information about the case. Castle goes undercover at an elementary school to try and identify the second-grader but nothing goes as planned.', 'Y', 'N', 8.2),
	('Castle', 'Meme Is Murder', 7, 5, 'Yes', 'Yes', 'Yes', 27, 10, 2014, 'When a web celebrity is murdered, Castle and Beckett explore the flashy world of internet fame. But when the killer posts pictures from the crime scene on a photo-sharing site, they realize they are up against a social media sociopath who may strike again. ', 'Y', 'N', 8.3),
	('Castle', 'The Time Of Our Lives', 7, 6, 'Yes', 'Yes', 'Yes', 10, 11, 2014, 'A murder investigation launches Castle into what seems to be an alternate universe where he\'s never met Kate Beckett. Castle has to convince Beckett, Esposito and Ryan -- now complete strangers -- to let him participate in their investigation so he can find his way back to his own world. This inspires Castle & Beckett to finally take a trip to the altar.', 'Y', 'N', 8.9),
	('Castle', 'Once Upon A Time In The West', 7, 7, 'Yes', 'Yes', 'Yes', 17, 11, 2014, 'When Castle and Beckett learn that a murder victim may have been poisoned at an Old West-style resort, they visit the resort posing as newlyweds to uncover the truth.', 'Y', 'N', 8.4),
	('Castle', 'Kill Switch', 7, 8, 'Yes', 'Yes', 'Yes', 24, 11, 2014, 'When subway passengers, including Detective Esposito, are taken hostage by a mysterious gunman, Castle, Beckett and the team must uncover the gunman\'s agenda before its too late.', 'Y', 'N', 8.3),
	('Castle', 'Last Action Hero', 7, 9, 'Yes', 'Yes', 'Yes', 1, 12, 2014, 'When the star of Castles favorite 80s action movie is mysteriously murdered, Castle and Beckett delve into the victims secret past and pursue his killer with help from a team of aging action heroes.', 'Y', 'N', 7.9),
	('Castle', 'Bad Santa', 7, 10, 'Yes', 'Yes', 'Yes', 8, 12, 2014, 'When an ER physician is gunned down in the street, Castle and Beckett soon discover that the victim was a mob doctor to a Mafia family run by an old friend of Castle\'s. Also, against this backdrop of Christmas, Esposito and Lanie reach a defining moment in their relationship.', 'Y', 'N', 8.2),
	('Castle', 'Castle, P.I.', 7, 11, 'Yes', 'Yes', 'Yes', 12, 1, 2015, 'After being forbidden to work with Kate Beckett or the 12th Precinct, Castle obtains a P.I. license and shows up unannounced at Beckett\'s crime scene, hoping to investigate alongside her as a private eye. But things don\'t go as Castle had planned.', 'Y', 'N', 8.8),
	('Castle', 'Private Eye Caramba!', 7, 12, 'Yes', 'Yes', 'Yes', 19, 1, 2015, 'When a young Latin telenovela actress is murdered, Beckett and the team delve into a case that is as flamboyant and full of intrigue as any telenovela. Meanwhile, Castle is hired as private investigator by the show\'s sultry star to pursue the case from another angle.', 'Y', 'N', 8.2),
	('Castle', 'I, Witness', 7, 13, 'Yes', 'Yes', 'Yes', 2, 2, 2015, 'Castle takes on a routine P.I. case, but the investigation turns deadly when he witnesses a murder.', 'Y', 'N', 8.4),
	('Castle', 'Resurrection', 7, 14, 'Yes', 'Yes', 'Yes', 9, 2, 2015, 'When clues in a murder implicate Castle and Beckett\'s nemesis, Dr. Kelly Nieman, Castle is called in to consult on the case.', 'Y', 'N', 9.2),
	('Castle', 'Reckoning', 7, 15, 'Yes', 'Yes', 'Yes', 16, 2, 2015, 'In the second installment of the Castle two-parter, stakes rise as the 12th Precinct matches wits with serial killers Jerry Tyson (3XK) and Dr. Kelly Nieman. With the clock ticking, Castle and the team must crack the case before the killers claim their next victim.', 'Y', 'N', 9.3),
	('Castle', 'The Wrong Stuff', 7, 16, 'Yes', 'Yes', 'Yes', 23, 2, 2015, 'When an astronaut, training for a trip to Mars, is mysteriously killed inside a Mars simulation, Castle and Beckett don spacesuits to investigate. But when they discover no one inside the sealed simulation could have committed the murder and no one from the outside could get in, the case takes a shocking turn', 'Y', 'N', 8.3),
	('Castle', 'Hong Kong Hustle', 7, 17, 'Yes', 'Yes', 'Yes', 16, 3, 2015, 'After a man is mysteriously murdered in a park, Castle and Beckett team up with a competitive, high-powered female detective from Hong Kong, who has information about the victim. But as Beckett digs deeper into the case, she realizes neither her Hong Kong colleague nor the victim may be quite who they seem.', 'Y', 'N', 8),
	('Castle', 'At Close Range', 7, 18, 'Yes', 'Yes', 'Yes', 23, 3, 2015, 'Detective Kevin Ryan is on the security detail of a charismatic congressman attending a charity event when shots suddenly ring out. Driven to apprehend the killer, Ryan must revisit the events that led up to the shooting, with the help of Castle and Beckett.', 'Y', 'N', 8.5),
	('Castle', 'Habeas Corpse', 7, 19, 'Yes', 'Yes', 'Yes', 30, 3, 2015, 'When Richie The Pitbull Falco, a larger-than-life personal-injury attorney is found dead, Beckett and Castle investigate the many clients and competitors who had motive to kill him. But the mystery deepens when they discover a shocking secret that may be linked to Richies murder.', 'Y', 'N', 8.1),
	('Castle', 'Sleeper', 7, 20, 'Yes', 'Yes', 'Yes', 20, 4, 2015, 'A mysterious recurring dream drives Castle and Beckett to seek answers about the two-month period when he went missing. But their search for the truth has deadly consequences.', 'Y', 'N', 8),
	('Castle', 'In Plane Sight', 7, 21, 'Yes', 'Yes', 'Yes', 27, 4, 2015, 'As Castle and Alexis travel to London, their routine flight turns deadly when the planes Air Marshal is found murdered. With the help of Beckett on the ground, Castle and Alexis race against time to find the killer before he carries out his fateful plan.', 'Y', 'N', 8.3),
	('Castle', 'Dead From New York', 7, 22, 'Yes', 'Yes', 'Yes', 4, 5, 2015, 'When Sid Ross, the powerful creator of a long-running sketch comedy show is killed, Castle and Beckett are called to investigate. But as they delve into the victim\'s life and the colorful world of \'Saturday Night Tonight,\' they uncover a shocking secret that may explain Sid\'s murder.', 'Y', 'N', 7.6),
	('Castle', 'Hollander\'s Woods', 7, 23, 'Yes', 'Yes', 'Yes', 11, 5, 2015, 'A death in the woods draws Castle back to a terrifying and defining event in his childhood. Investigation leads to obsession, as he attempts to unearth answers that have eluded him for decades, all while Beckett faces a crossroads of her own.', 'Y', 'N', 8.8),
	('Castle', 'XY', 8, 1, 'Yes', 'Yes', 'Yes', 21, 9, 2015, 'After passing the Captain\'s exam last season, Beckett was surprised with an offer to run for State Senate. In the action packed season premiere, Castle and Beckett are adjusting to Beckett\'s career change, when a call from a mysterious stranger sets off an explosive chain of events. There are two sides to every story, and this unique two-parter will explore the same story from each of their perspectives, first from Castle\'s side as he searches for Beckett.', 'Y', 'N', 8.5),
	('Castle', 'XX', 8, 2, 'Yes', 'Yes', 'Yes', 28, 9, 2015, 'In part 2 of the premiere, Beckett\'s side of her abrupt disappearance is revealed. After receiving a mysterious tip from her past, Beckett is launched into a fight for her life, with a team of mercenaries hot on her trail. While Castle investigates why his wife is on the run, Beckett must figure out who wants her dead, before they can finish the job.', 'Y', 'N', 7.3),
	('Castle', 'PhDead', 8, 3, 'Yes', 'Yes', 'Yes', 5, 10, 2015, 'When the body of a local college fraternity student is found gruesomely murdered, Castle has to go undercover as a professor in order to gain access to the victim\'s world. However, he and Beckett soon discover that behind the fun and games of college are some darker secrets the university wants to keep hidden.', 'Y', 'N', 7.8),
	('Castle', 'What Lies Beneath', 8, 4, 'Yes', 'Yes', 'Yes', 12, 10, 2015, 'When Castle\'s idol, a famously reclusive author, turns up dead, Castle is determined to solve his hero\'s murder. But as he and Beckett dig deeper, they discover that truth is stranger than fiction.', 'Y', 'N', 7.5),
	('Castle', 'The Nose', 8, 5, 'Yes', 'Yes', 'Yes', 19, 10, 2015, 'When a priceless work of art is stolen and its transporter murdered, Castle and Beckett must work with the key witness to track down the painting and sniff out the killer.', 'Y', 'N', 8.4),
	('Castle', 'Cool Boys', 8, 6, 'Yes', 'Yes', 'Yes', 9, 11, 2015, 'Detective Slaughter returns to enlist Castle\'s help in solving a high-stakes robbery case. But when a body is found linked to the crime, Slaughter becomes the number one suspect in the heist turned murder, while Castle has to determine whether he\'s guilty or help to prove he\'s innocent.', 'Y', 'N', 8.2),
	('Castle', 'The Last Seduction', 8, 7, 'Yes', 'Yes', 'Yes', 16, 11, 2015, 'In order to hunt down the brutal murderer of a grifting seducer, Castle & Beckett must investigate New York\'s elite. Meanwhile, Castle plans to surprise Beckett on their one-year wedding anniversary.', 'Y', 'N', 8.2),
	('Castle', 'Mr. & Mrs. Castle', 8, 8, 'Yes', 'Yes', 'Yes', 23, 11, 2015, 'Castle and Beckett investigate the murder of a cruise ship entertainer, only to find themselves trapped at sea with the killer.', 'Y', 'N', 8),
	('Castle', 'Tone Death', 8, 9, 'Yes', 'Yes', 'Yes', 8, 2, 2016, 'When a body is found in the theater of Martha\'s latest show, Castle and Beckett\'s investigation leads them into the unexpectedly dangerous world of competitive a capella.', 'Y', 'N', 8.1),
	('Castle', 'Witness For The Prosecution', 8, 10, 'Yes', 'Yes', 'Yes', 14, 2, 2016, 'Castle finally gets his day in court when he takes the stand as the key witness to a murder from five months ago. But when new information suddenly arises, he and Beckett must race against the clock to prevent a miscarriage of justice.', 'Y', 'N', 8.3),
	('Castle', 'Dead Red', 8, 11, 'Yes', 'Yes', 'Yes', 15, 2, 2016, 'When the son of a Russian diplomat turns up murdered, Beckett and Castle find themselves in a dangerous game of international crime and punishment, with Castle having to entertain a jovial Russian security officer who winds up more involved than anyone planned.', 'Y', 'N', 8.2),
	('Castle', 'The Blame Game', 8, 12, 'Yes', 'Yes', 'Yes', 22, 2, 2016, 'Castle is abducted and forced to work with strangers to solve deranged puzzles and mind games, while Beckett and the 12th Precinct must race against time to rescue Castle and catch a killer.', 'Y', 'N', 8.6),
	('Castle', 'And Justice For All', 8, 13, 'Yes', 'Yes', 'Yes', 29, 2, 2016, 'Beckett and the 12th Precinct look into the murder of an English as a Second Language student. But when the victim\'s class won\'t talk to the police, Castle goes undercover as a French Canadian immigrant and learns that the victim was more than he seemed.', 'Y', 'N', 7.9),
	('Castle', 'The G.D.S.', 8, 14, 'Yes', 'Yes', 'Yes', 7, 3, 2016, 'Castle returns to the City of Angels in search of answers about his missing time. But things take a deadly turn when he\'s recruited by the legendary Greatest Detective Society to help solve a murder.', 'Y', 'N', 8),
	('Castle', 'Fidelis Ad Mortem', 8, 15, 'Yes', 'Yes', 'Yes', 21, 3, 2016, 'When a recruit officer at the NYPD Academy is killed, Beckett and the team go back to their old training ground to investigate. Meanwhile, Castle must reckon with a decision with profound consequences for him and Beckett.', 'Y', 'N', 8.1),
	('Castle', 'Heartbreaker', 8, 16, 'Yes', 'Yes', 'Yes', 4, 4, 2016, 'A clue at the scene of the death of an armored-car driver leads Beckett and Castle back to an old case solved by Esposito. But complications arise when they learn that Esposito might not have been telling them everything about his past with the culprit.', 'Y', 'N', 8.4),
	('Castle', 'Death Wish', 8, 17, 'Yes', 'Yes', 'Yes', 11, 4, 2016, 'The murder of a man connected to smuggling Turkish relics sends Castle, Beckett and the 12th Precinct on a search for a stolen antique believed to be Aladdin\'s lamp, in hopes that it can lead them to the killer.', 'Y', 'N', 7.9),
	('Castle', 'Backstabber', 8, 18, 'Yes', 'Yes', 'Yes', 18, 4, 2016, 'When Hayley finds herself being implicated in a cyber-terror attack after doing an old friend a favor, Castle and Beckett rush to clear her name.', 'Y', 'N', 7.7),
	('Castle', 'Dead Again', 8, 19, 'Yes', 'Yes', 'Yes', 25, 4, 2016, 'When a mild mannered safety inspector for the city miraculously survives a poisoning, it might be luck; but when he survives another, it\'s a mystery Castle and Beckett will have to solve.', 'Y', 'N', 8.2),
	('Castle', 'Much Ado About Murder', 8, 20, 'Yes', 'Yes', 'Yes', 2, 5, 2016, 'After a movie star turned theater actor is mysteriously killed, Castle and Beckett go backstage and learn the star had more to worry about than just his lines.', 'Y', 'N', 7.8),
	('Castle', 'Hell To Pay', 8, 21, 'Yes', 'Yes', 'Yes', 9, 5, 2016, 'When an axe-wielding, escaped psychiatric inmate drops dead in Castles P.I. office, Castle and Becketts investigation leads Castle to suspect the victims death could be the work of the Antichrist.', 'Y', 'N', 8.3),
	('Castle', 'Crossfire', 8, 22, 'Yes', 'Yes', 'Yes', 16, 5, 2016, 'With their best lead in hand, Castle and Beckett are ready to take on LokSat. But an unforeseen twist puts their case  and their lives  in jeopardy.', 'Y', 'N', 7.3),
	('Coupling', 'Flushed', 1, 1, 'Yes', 'Yes', 'Yes', 12, 5, 2000, 'Jeff reckons Steve is still in \'The Zone\' with Jane: the time after the breakup when there can still be sex, but he wants to date Susan instead. When he has a meal in a restaurant with Jane, Susan walks in. ', 'Y', 'N', 8.4),
	('Coupling', 'Size Matters', 1, 2, 'Yes', 'Yes', 'Yes', 19, 5, 2000, 'Susan invites Steve for a date at home, and offers to cook. Jeff warns him about \'The Sock Gap\', and Patrick alerts him to her collection of remote controls. Somehow everyone\'s conversation seems to revolve around Patrick\'s size, and Jeff is asked by several people to accompany him to the toilet to check. ', 'Y', 'N', 8.7),
	('Coupling', 'Sex, Death & Nudity', 1, 3, 'Yes', 'Yes', 'Yes', 26, 5, 2000, 'Jeff explains to the guys about \'The Giggle Loop\': the danger that the more you try to suppress laughter in important silences, the harder you want to laugh. Jane\'s aunt has died, and she wants Steve to come to the funeral, pretending to be her boyfriend still. Susan invites herself, and so Patrick must come as her \'boyfriend\', and all six end up going.', 'Y', 'N', 8.8),
	('Coupling', 'Inferno', 1, 4, 'Yes', 'Yes', 'Yes', 2, 6, 2000, 'Steve is plunged into total panic when he suspects that Susan has found one of his porn videos. To fill the embarrassing silence, he tells her he loves her, but Susan is well-aware that he was merely panicking. Susan invites all the friends over for a dinner party. Jane brings her therapist, Jill, who everyone assumes is there as Jane\'s date. In front of everyone, Susan insists that Steve justify his passion for the offending porn film, Lesbian Spank Inferno.', 'Y', 'N', 9.1),
	('Coupling', 'The Girl With Two Breasts', 1, 5, 'Yes', 'Yes', 'Yes', 9, 6, 2000, 'Jeff and co. can\'t take their eyes of a beautiful stranger in their local bar. And the girl can\'t take her eyes off Jeff. Jeff goes over to talk to her, only to discover that she doesn\'t speak a word of English, which to Jeff of course is quite a relief. Her interpreter, Alice, tells Jeff she\'s Israeli, then whisks her away. The next day the girl is back and Jeff attempts to chat her up. With neither speaking a word of the other\'s language, it is an utter disaster.', 'Y', 'N', 9.1),
	('Coupling', 'The Cupboard Of Patrick\'s Love', 1, 6, 'Yes', 'Yes', 'Yes', 16, 6, 2000, 'Patrick has a cupboard of video tapes of his former girlfriends, not to mention Britt Ekland in The Wicker Man. Jeff is excited, but Steve is appalled, when he realizes that Susan must be amongst them. Susan is also horrified when she realizes this in the company of the other girls. Later on, she arrives at Patrick\'s, and is outraged at what she finds going on there.', 'Y', 'N', 8.7),
	('Coupling', 'The Man With Two Legs', 2, 1, 'Yes', 'Yes', 'Yes', 3, 9, 2001, 'Jeff finally gets to speak to Chrissy, the woman on the train whose leg he has been fancying for days, and tells her that he only has one leg, a lie which becomes ever harder to undo. Meanwhile, Sally is dating a \'surgeon\' called David, and Jeff wonders whether it would be easier.', 'Y', 'N', 9.1),
	('Coupling', 'My Dinner In Hell', 2, 2, 'Yes', 'Yes', 'Yes', 10, 9, 2001, 'After watching an embarrassing program on TV with Susan, Steve bumps into his dream celebrity, Mariella Frostrup, in the bar, but it is not the dream encounter he might like, as she pours her drink down his trousers. Jane and Sally\'s attempt to make friends with her get him into more trouble as he then has to have dinner with Susan\'s liberal-minded parents, which turns into a nightmare as misunderstandings multiply.', 'Y', 'N', 8.6),
	('Coupling', 'Her Best Friend\'s Bottom', 2, 3, 'Yes', 'Yes', 'Yes', 17, 9, 2001, 'When Steve pops into Susan\'s flat, he accidentally sees Sally\'s naked bottom. This incident leads to dilemmas and awkwardness all round, which are dealt with in the classic sequence outlined by Jeff: the prickles (an embarrassed silence), the blurts (talking too fast), followed by the \'head laugh\'.', 'Y', 'N', 8.6),
	('Coupling', 'The Melty Man Cometh', 2, 4, 'Yes', 'Yes', 'Yes', 24, 9, 2001, 'Following their disastrous encounter, Patrick seeks reassurance from Steve & Jeff, who explain to him the theory of the Melty Man, and Sally seeks reassurance from Jane & Susan, who try to comfort her with their own \'failure\' experiences.', 'Y', 'N', 8.4),
	('Coupling', 'Jane And The Truth Snake', 2, 5, 'Yes', 'Yes', 'Yes', 1, 10, 2001, 'Jane gets the sack as a traffic reporter for a local radio station, and decides on a new career in children\'s entertainment. She starts rehearsing with a pink snake hand puppet, which turns out to have an unstoppable ability to tell the bald truth. Patrick is trying to dump his latest girlfriend Lynda, but when she says she\'s interested in a threesome, he desperately starts backtracking.', 'Y', 'N', 8.3),
	('Coupling', 'Gotcha', 2, 6, 'Yes', 'Yes', 'Yes', 8, 10, 2001, 'It\'s one year since Steve and Susan\'s first date, and he is dreading questions about their future. And then a wedding invitation drops through their front door. Patrick meets an ex who appears to fail to recognize him.', 'Y', 'N', 8.4),
	('Coupling', 'Dressed', 2, 7, 'Yes', 'Yes', 'Yes', 15, 10, 2001, 'Patrick has boasted to his business associate, Ivan, amongst other things that he has a wife, and when Ivan comes to the bar, Patrick presses Sally and then Susan into pretending to be his wife. Things turn awkward when Steve proposes to Susan while she is pretending to be faithfully married to Patrick. Meanwhile, Jane is invited on a dinner date by Bill, a man she chatted up in a pub, but makes an unfortunate choice of clothing for the evening.', 'Y', 'N', 8.6),
	('Coupling', 'Naked', 2, 8, 'Yes', 'Yes', 'Yes', 22, 10, 2001, 'As Jeff\'s 30th birthday approaches, his new boss Julia Davis questions the girls about whether one should kiss a junior work colleague, while Jeff admits to the lads that he had a close encounter of the Nat (Nose Avoidance Tilt) kind in a stationery cupboard at work.', 'Y', 'N', 9.2),
	('Coupling', 'The End Of The Line', 2, 9, 'Yes', 'Yes', 'Yes', 29, 10, 2001, 'Steve and Susan\'s relationship is drifting into a new phase. They are beginning to get on each other\'s nerves. A bizarre set of misunderstandings brings on a crisis.', 'Y', 'N', 9.2),
	('Coupling', 'Split', 3, 1, 'Yes', 'Yes', 'Yes', 23, 9, 2002, 'Steve and Susan have had an argument about their future, and Susan storms out of Steve\'s flat in tears. While Steve tries repeatedly to ring Susan, his courage failing every time, the girls are locked in a debate over the merits of 1471, and what it means if the phone \'chirps\'. Eventually the tension at both ends of the phone gets too much. The boys and the girls set out for \'the Temple of Woman\': in  the girls\' case, a beauty salon; in the boys\' case, a lap dancing club.', 'Y', 'N', 8.7),
	('Coupling', 'Faithless', 3, 2, 'Yes', 'Yes', 'Yes', 30, 9, 2002, 'Jane finds herself competing with the Supreme Being of the Universe and she feels it isn\'t fair on either of them. Jeff finds himself in the middle when he has to decide to cheat his girlfriend Julia with Wilma or not.', 'Y', 'N', 8.6),
	('Coupling', 'Unconditional Sex', 3, 3, 'Yes', 'Yes', 'Yes', 7, 10, 2002, 'Jeff is still trying to decide whether he should cheat on his girlfriend Julia with Wilma, or not. While his friends try to help him, Jeff is no match in this debate for \'devil woman\' Wilma. She knows every argument that Susan (the expert in getting her own way) has ever used. Jeff paints himself into a terrifyingly extreme conversational corner, until he blurts out that the reason he can\'t have sex with Wilma is that his girlfriend is dead...', 'Y', 'N', 8.9),
	('Coupling', 'Remember This', 3, 4, 'Yes', 'Yes', 'Yes', 14, 10, 2002, 'Sally is surprised to say the least when Patrick arrives at her flat at three in the morning to get rid of a spider for her. It turns out that he dreamt her distress call. What can this mean? Does Patrick subconsciously want to protect Sally? More shockingly, does Patrick have a subconscious?  Encouraged by their friends, Sally and Patrick independently tell the story of how they first met...', 'Y', 'N', 8.8),
	('Coupling', 'The Freckle, The Key And The Couple Who Weren\'t', 3, 5, 'Yes', 'Yes', 'Yes', 21, 10, 2002, 'Steve is troubled by a blemish on his bottom, which Susan hasn\'t noticed. James remembers where he knows Susan from. Jeff and Julia try spicing up their love life, but he loses the key to the handcuffs. Then Julia\'s chunky ex-boyfriend calls round, and he has to pretend that they\'re not a couple.', 'Y', 'N', 8.5),
	('Coupling', 'The Girl With One Heart', 3, 6, 'Yes', 'Yes', 'Yes', 28, 10, 2002, 'Susan has invited everyone over for dinner, which as we know is just asking for trouble. Steve is particularly worried because Susan has recently redecorated the bathroom, and removed the lock, thus robbing him of his Fortress of Solitude. Sally\'s worry is that Patrick is bringing his new girlfriend: she\'s frightened that she will overcompensate her feelings of hostility towards her new rival by being embarrassingly nice. Patrick dimly perceives there might be a problem, so has told Jennifer that Sally is a lesbian...', 'Y', 'N', 8.8),
	('Coupling', 'Perhaps, Perhaps, Perhaps', 3, 7, 'Yes', 'Yes', 'Yes', 4, 11, 2002, 'Sally is terrified that she might be pregnant, so she takes a pregnancy test and asks the other girls to do the same so that she knows what a negative result looks like. In her fluster she gets the tests muddled up. One of the girls is pregnant, but which one?', 'Y', 'N', 9),
	('Coupling', 'Nine And A Half Minutes', 4, 1, 'Yes', 'Yes', 'Yes', 10, 5, 2004, 'One bar, three different points of view, the same nine and a half minutes. Susan and Steve are pregnant (mostly Susan), Patrick and Sally are discussing relationships (mostly Sally), and Jane has a blind date - but will his job be a problem? Meanwhile, in the skies above an Aegean island, terrible danger grows.', 'Y', 'N', 8.2),
	('Coupling', 'Nightlines', 4, 2, 'Yes', 'Yes', 'Yes', 17, 5, 2004, 'A phone call between Susan and Sally grows and grows as Steve, Patrick, Oliver and Jane gradually find their way onto the line. Will the phone call ever end?', 'Y', 'N', 8.1),
	('Coupling', 'Bed Time', 4, 3, 'Yes', 'Yes', 'Yes', 24, 5, 2004, 'Since the dawn of time, men and women have been falling in love - and men have been trying to get straight home afterwards. Can fallen playboy Patrick Maitland ever find his way home from the Enchanted Glade of his one true love and get a decent night\'s kip? Kate Isitt as Sally makes her singing debut.', 'Y', 'N', 7.7),
	('Coupling', 'Circus Of The Epidurals', 4, 4, 'Yes', 'Yes', 'Yes', 31, 5, 2004, 'It\'s time to start attending antenatal classes. Susan need a back-up birth partner, Steve is haunted by the ghost of spanking lesbians past and Sally is seeking the solace of a string quartet. Meanwhile, Jane is trying to find a way to out-keen Oliver.', 'Y', 'N', 7.6),
	('Coupling', 'The Naked Living Room', 4, 5, 'Yes', 'Yes', 'Yes', 7, 6, 2004, 'Oliver invites Jane to his apartment, not realizing that things such as porn and dirty dishes now replace the floor. Meanwhile Patrick lets the fact slip that he slept with Jane during a conversation with Oliver and Patrick which gets back to Sally. While all the drama unfolds Susan realizes that the pains in her stomach means the baby is finally on his way.', 'Y', 'N', 7.8),
	('Coupling', 'Nine And A Half Months', 4, 6, 'Yes', 'Yes', 'Yes', 14, 6, 2004, 'Steve panics at Susan goes into labour, Patrick panics as Sally goes Hulk-style mad after finding out he\'s slept with Jane, who is oblivious to all the tension and is having a blissful afternoon with Oliver.', 'Y', 'N', 8.2),
	('Designated Survivor', 'Pilot', 1, 1, 'Yes', 'Yes', 'No', 21, 9, 2016, 'Lower-level cabinet member Tom Kirkman becomes President of the United States after a catastrophic attack on the U.S. Capitol. Kirkman must keep the country and his family safe while leading the search for the those responsible for the attack.', 'N', 'N', 8.2),
	('Designated Survivor', 'The First Day', 1, 2, 'Yes', 'Yes', 'No', 28, 9, 2016, 'Hours after the attack on the Capitol, President Kirkman steps into his role as Commander-in-Chief in the midst of chaos and confusion. Facing dangerous new challenges and adversaries, Kirkman struggles to hold a country together that is on the brink of falling apart.', 'N', 'N', 8.1),
	('Designated Survivor', 'The Confession', 1, 3, 'Yes', 'Yes', 'No', 5, 10, 2016, 'President Kirkman and his staff work to keep a high-level security breach of the White House a secret just as hes about to give his first television interview. The FBI continues to investigate the Capitol bombing but Agent Hannah Wells starts to develop her own theories about who was really behind the attack.', 'N', 'N', 7.9),
	('Designated Survivor', 'The Enemy', 1, 4, 'Yes', 'Yes', 'No', 12, 10, 2016, 'Kirkman learns who is behind the attack and needs to grapple not only with the prospect of war, but brewing domestic troubles as well. Kirkman taps Emily to monitor the domestic situation. Alex may be in for more than she bargains for when she seeks out help from Hookstraten.', 'N', 'N', 8.1),
	('Designated Survivor', 'The Mission', 1, 5, 'Yes', 'Yes', 'No', 26, 10, 2016, 'Realizing his attempts at diplomacy with Algeria have failed, President Kirkman makes the difficult decision of sending Navy SEALs on a mission that will define his presidency. Agent Hannah Wells discovers more secrets than answers.', 'N', 'N', 7.9),
	('Designated Survivor', 'The Interrogation', 1, 6, 'Yes', 'Yes', 'No', 9, 11, 2016, 'When shots ring out at The White House during a Governors Summit, President Kirkmans plans at electing a new Congress are thrown into turmoil. Agent Hannah Wells continues investigating the Capitol bombing and makes one of her most shocking discoveries yet.', 'N', 'N', 7.6),
	('Designated Survivor', 'The Traitor', 1, 7, 'Yes', 'Yes', 'No', 16, 11, 2016, 'When an American track-and-field coach heads to Russia, President Kirkman is thrust into a hostage exchange involving the CIA and the Russian government. Agent Hannah Wells and Deputy Director Atwood\'s investigation into the Capitol bombing uncovers information that puts Atwood and his family\'s life at risk.', 'N', 'N', 7.7),
	('Designated Survivor', 'The Results', 1, 8, 'Yes', 'Yes', 'No', 30, 11, 2016, 'On the eve of the country voting to elect a new House of Representatives, an unexpected development forces Kirkman to consider cancelling the elections entirely. News about Majid Nassars death leaks out, and Kirkman has to handle the fallout.', 'N', 'N', 7.6),
	('Designated Survivor', 'The Blueprint', 1, 9, 'Yes', 'Yes', 'No', 7, 12, 2016, 'When classified government documents are leaked online, President Kirkman searches for the party responsible only to find that they have taken refuge inside a foreign embassy and are beyond even his reach. Agent Hannah Wells races furiously to gather evidence of MacLeish\'s involvement in the conspiracy before he can be confirmed as the country\'s next Vice President.', 'N', 'N', 8),
	('Designated Survivor', 'The Oath', 1, 10, 'Yes', 'Yes', 'No', 14, 12, 2016, 'President Kirkman fears there could be a traitor in the White House when he discovers shocking information connected to the Capitol Bombing. Confiding in Emily, Kirkman puts her in charge of quietly investigating. New information surfaces about Congressman MacLeish, raising concerns regarding his vice presidential nomination.', 'N', 'N', 8.7),
	('Designated Survivor', 'Warriors', 1, 11, 'Yes', 'Yes', 'No', 8, 3, 2017, 'The nation reels from the aftermath of the shooting on the steps of the Capitol while Emily struggles with the knowledge there may be a traitor in the White House. Agent Hannah Wells grapples with her decision to reveal what she knows about the conspiracy behind the Capitol bombing.', 'N', 'N', 8.2),
	('Designated Survivor', 'The End Of The Beginning', 1, 12, 'Yes', 'Yes', 'No', 15, 3, 2017, 'Circles must tighten as a new discovery within the conspiracy emerges. Tension rises between Aaron and Emily as suspicions loom in the White House. A new lead places Agent Wells closer than before to the truth.', 'N', 'N', 8.4),
	('Designated Survivor', 'Backfire', 1, 13, 'Yes', 'Yes', 'No', 22, 3, 2017, 'An investigative journalist shocks the White House when he reveals classified information during a press briefing and leaves Seth struggling to contain the damage from the leaked story. Hannah unearths a key connection between MacLeish and the conspiracy.', 'N', 'N', 7.4),
	('Designated Survivor', 'Commander-In-Chief', 1, 14, 'Yes', 'Yes', 'No', 29, 3, 2017, 'Turmoil in an African country forces President Kirkman to rely on an unlikely ally for help, as Hannah\'s investigation into the Capitol bombing takes an unexpected turn. Meanwhile, Emily settles into her new role as chief of staff while Aaron has to make a difficult choice.', 'N', 'N', 7.8),
	('Designated Survivor', 'One Hundred Days', 1, 15, 'Yes', 'Yes', 'No', 5, 4, 2017, 'As President Kirkman releases an agenda to reset his presidency, Alex makes a controversial public statement that threatens to derail it. Agent Wells unknowingly finds herself in the center of a dangerous trap while getting closer to the truth. ', 'N', 'N', 7),
	('Designated Survivor', 'Party Lines', 1, 16, 'Yes', 'Yes', 'No', 12, 4, 2017, 'President Kirkman forms an unlikely alliance in the hopes of passing his first bill. Agent Ritter is briefed by Agent Wells about a new alarming threat to the nation.', 'N', 'N', 7.1),
	('Designated Survivor', 'The Ninth Seat', 1, 17, 'Yes', 'Yes', 'No', 19, 4, 2017, 'As President Kirkman struggles to put together a new Supreme Court, FBI Agent Hannah Wells goes undercover and discovers much more than she ever could have imagined. Seth Wright has to contend with journalist Abe Leonard, who returns from the Middle East with an explosive story.', 'N', 'N', 7.2),
	('Designated Survivor', 'Lazarus', 1, 18, 'Yes', 'Yes', 'No', 26, 4, 2017, 'As President Kirkman considers candidates for Vice President, Kimble Hookstraten finds herself embroiled in scandal. Agent Wells and Jason Atwood return from North Dakota with a critical new lead while journalist Abe Leonard\'s investigation takes an unexpected turn.', 'N', 'N', 7),
	('Designated Survivor', 'Misalliance', 1, 19, 'Yes', 'Yes', 'No', 3, 5, 2017, 'As the White House gears up for President Kirkmans first international summit, Kimble Hookstraten faces her toughest political battle yet when her speakership is challenged. Meanwhile, Alex wrestles with whether or not to bring the kids back to Washington.', 'N', 'N', 6.9),
	('Designated Survivor', 'Bombshell', 1, 20, 'Yes', 'Yes', 'No', 10, 5, 2017, 'President Kirkmans first international summit is derailed when journalist Abe Leonard publishes an explosive article. Meanwhile, Hannah Wells uncovers the conspiracys next target.', 'N', 'N', 7.3),
	('Designated Survivor', 'Brace For Impact', 1, 21, 'Yes', 'Yes', 'No', 17, 5, 2017, 'Hannah Wells must stop the conspiracy from carrying out a final attack while President Kirkman authorizes a nationwide manhunt for the mastermind behind it all.', 'N', 'N', 7.4),
	('Dexter', 'Dexter', 1, 1, 'Yes', 'Yes', 'No', 1, 10, 2006, 'Dexter is a forensic expert in blood patterns who works with the Miami Police Department. He is also a serial killer, who kills people that the police can\'t bring to justice. He has to hide his double life from his sister, his girlfriend and his co-workers. He is intrigued by a killer who has found a way to kill girls without leaving blood behind.', 'Y', 'N', 8.8),
	('Dexter', 'Crocodile', 1, 2, 'Yes', 'Yes', 'No', 8, 10, 2006, 'Being wrapped up in preparing for his next victim, Dexter, finds out that the Ice Truck Killer is aware of Dexter\'s dirty little secret.', 'Y', 'N', 8.4),
	('Dexter', 'Popping Cherry', 1, 3, 'Yes', 'Yes', 'No', 15, 10, 2006, 'Dexter\'s on the trail of a recently released murderer who plans to kill again when he\'s sidetracked by the Ice Truck Killer\'s latest crime - a cut-up hooker found in a hockey ice rink.', 'Y', 'N', 8.5),
	('Dexter', 'Let\'s Give The Boy A Hand', 1, 4, 'Yes', 'Yes', 'No', 22, 10, 2006, 'The Ice Truck Killer begins leaving pictures from Dexter\'s childhood at the crime scenes. Is the killer trying to tell Dexter something about his own past?', 'Y', 'N', 8.8),
	('Dexter', 'Love American Style', 1, 5, 'Yes', 'Yes', 'No', 29, 10, 2006, 'While the rest of the police department are focused on finding the Ice Truck Killer, Dexter is busy gathering evidence for his next victim. It turns out he will also discover more about relationships, love and how to make a success of it all. In doing so he gets some hilarious advice from unlikely sources and we see the first time that he actually kills two people at one time.', 'Y', 'N', 8.7),
	('Dexter', 'Return To Sender', 1, 6, 'Yes', 'Yes', 'No', 5, 11, 2006, 'Dexter is called to the scene of the crime at the Castillo junkyard. The Ice Truck Killer has returned Valerie Castillo\'s body putting Dexter in danger of being caught. A boy is found who witnessed the crime.', 'Y', 'N', 9),
	('Dexter', 'Circle Of Friends', 1, 7, 'Yes', 'Yes', 'No', 12, 11, 2006, 'The police identify the Ice Truck Killer. However Dexter feels there is something wrong with the suspect. Dexter must also deal with Paul, Rita\'s recently paroled husband.', 'Y', 'N', 8.8),
	('Dexter', 'Shrink Wrap', 1, 8, 'Yes', 'Yes', 'No', 19, 11, 2006, 'Dexter suspects rich women\'s shrink of murder. When he visits the shrink, he is surprised by a dark secret from his past.', 'Y', 'N', 9.1),
	('Dexter', 'Father Knows Best', 1, 9, 'Yes', 'Yes', 'No', 26, 11, 2006, 'Dexter receives notification that his biological father has recently passed away. Dexter is named as the sole heir of all his possessions including his house. Dexter goes for a weekend away with Rita, Deb, and Rudy.', 'Y', 'N', 8.7),
	('Dexter', 'Seeing Red', 1, 10, 'Yes', 'Yes', 'No', 3, 12, 2006, 'The Ice Truck Killer is back. He leaves a crime scene that brings back some horrifying repressed memories for Dexter. Paul sues Rita for sole custody of Astor and Cody.', 'Y', 'N', 9.2),
	('Dexter', 'Truth Be Told', 1, 11, 'Yes', 'Yes', 'No', 10, 12, 2006, 'The Ice Truck Killer puts Dexter in a life changing position when he takes someone close to Dexter hostage. Doakes begins to suspect that Dexter\'s odd behavior is something darker than he originally thought.', 'Y', 'N', 9.3),
	('Dexter', 'Born Free', 1, 12, 'Yes', 'Yes', 'No', 17, 12, 2006, 'Dexter follows clues left for him by the Ice-Truck Killer in an attempt to find the hostage.  Paul tries to convince Rita that she and the children are not safe around Dexter.', 'Y', 'N', 9.6),
	('Dexter', 'It\'s Alive!', 2, 1, 'Yes', 'Yes', 'No', 30, 9, 2007, 'Things are really beginning to heat up for Dexter: Doakes\' suspicions about him are growing, his victims are escaping, and his body dump site has been found. Meanwhile Paul is troubling Rita over the missing shoe and Debra is going through trauma over the Ice Truck killer incident.', 'Y', 'N', 8.9),
	('Dexter', 'Waiting To Exhale', 2, 2, 'Yes', 'Yes', 'No', 7, 10, 2007, 'Dexter is finding it hard to have closure on killing his brother. There is a new FBI agent to head the \'Bay Harbor Butcher\' case. Debra is finding it tough to put the past behind her.', 'Y', 'N', 8.7),
	('Dexter', 'An Inconvenient Lie', 2, 3, 'Yes', 'Yes', 'No', 14, 10, 2007, 'Dexter sets his sights on a new victim: a murderer so repulsive it seems only fitting that he\'s a used-car salesman. Dexter\'s been unable to lie to Rita about his midnight activities, which has her thinking that he\'s a drug addict. She\'s threatened to leave him if he doesn\'t commit to a 12-step program to deal with his supposed addiction. While in this recovery, though, Dexter meets a sexy, mysterious woman named Lila.', 'Y', 'N', 8.8),
	('Dexter', 'See-Through', 2, 4, 'Yes', 'Yes', 'No', 21, 10, 2007, 'Rita\'s estranged mother visits and senses something is wrong with Dexter. Masuka thinks he\'s developed a lead in the Bay Harbor Butcher case, which has Dexter concerned. Angel\'s interrogation of a witness crosses a line.', 'Y', 'N', 8.6),
	('Dexter', 'The Dark Defender', 2, 5, 'Yes', 'Yes', 'No', 28, 10, 2007, 'Dexter finds out that the man who killed his mother, right in front of him, is still alive. When he tells this to Lila, she suggests he face the man, as part of his road to addiction recovery. But then as his sponsor she insists on tagging along.', 'Y', 'N', 8.8),
	('Dexter', 'Dex, Lies, And Videotape', 2, 6, 'Yes', 'Yes', 'No', 4, 11, 2007, 'A copy-cat killer follows the lead of the \'Bay Harbor Butcher.\' Dexter must destroy an incriminating surveillance video.', 'Y', 'N', 8.7),
	('Dexter', 'That Night, A Forest Grew', 2, 7, 'Yes', 'Yes', 'No', 11, 11, 2007, 'Dexter manages to get Doakes off his back. He devises a plan to get the police in another direction. Lila and Dex\'s relationship intensifies, and he has some interaction with Rita and the kids.', 'Y', 'N', 8.8),
	('Dexter', 'Morning Comes', 2, 8, 'Yes', 'Yes', 'No', 18, 11, 2007, 'Dexter is attacked by the man who murdered his mother. Meanwhile, Lila wants to get closer to Dex, and Debra and Lundy close in on the Bay Harbor Butcher.', 'Y', 'N', 9.1),
	('Dexter', 'Resistance Is Futile', 2, 9, 'Yes', 'Yes', 'No', 25, 11, 2007, 'Dexter realizes it won\'t be easy to end things completely with Lila. Dexter tries to stay ahead of the investigations as the manhunt for the Bay Harbor Butcher intensifies. An enemy of Dexter figures out his secret.', 'Y', 'N', 9.4),
	('Dexter', 'There\'s Something About Harry', 2, 10, 'Yes', 'Yes', 'No', 2, 12, 2007, 'Doakes follows Dexter to his next crime scene and shocks him with a revelation about Harry. The Bay Harbor Butcher task force feels they are zeroing in on their man.', 'Y', 'N', 9),
	('Dexter', 'Left Turn Ahead', 2, 11, 'Yes', 'Yes', 'No', 9, 12, 2007, 'Dexter must make a massive decision that will have an effect on all those he holds close. Lila meanwhile is back with a secret to blackmail Dexter.', 'Y', 'N', 9.1),
	('Dexter', 'The British Invasion', 2, 12, 'Yes', 'Yes', 'No', 16, 12, 2007, 'The Task force believes the Bay Harbor Butcher case is closed, but Dexter still has some trouble to deal with.', 'Y', 'N', 9.2),
	('Dexter', 'Our Father', 3, 1, 'Yes', 'Yes', 'No', 28, 9, 2008, 'Dexter has put his life back together but things may fall apart soon. His new victim is also being targeted by Assistant District Attorney Miguel Prado. Deb has to decide how to handle Internal Affairs, as they want her to turn on her new partner.', 'Y', 'N', 8.5),
	('Dexter', 'Finding Freebo', 3, 2, 'Yes', 'Yes', 'No', 5, 10, 2008, 'Dexter continues the hunt for Freebo, knowing he is still in town after finding Teegan\'s body. Dexter and Rita must make a decision about her pregnancy. Dexter isn\'t sure whether he can raise a child. Deb searches for the identity of her body, not knowing the link to the Freebo case. Dexter races to beat the rest of the police to Freebo.', 'Y', 'N', 8.6),
	('Dexter', 'The Lion Sleeps Tonight', 3, 3, 'Yes', 'Yes', 'No', 12, 10, 2008, 'Dexter and a pedophile have a run-in; Dexter is unable to restore Freebo\'s good name after he is accused of a murder he didn\'t commit. Also, Dexter\'s friendship with Miguel weighs on his mind.', 'Y', 'N', 8.3),
	('Dexter', 'All In The Family', 3, 4, 'Yes', 'Yes', 'No', 19, 10, 2008, 'After a failed marriage proposal, Dexter attempts to convince Rita that he wants more than a financial merger and fatherhood. He wants a family with Rita. Deb lands a new case. Miguel\'s brother, Ramon, is dead set on finding Oscar\'s murderer, which worries Dexter and Miguel.', 'Y', 'N', 8.3),
	('Dexter', 'Turning Biminese', 3, 5, 'Yes', 'Yes', 'No', 26, 10, 2008, 'While Dexter struggles with how to handle Rita\'s desire for them to move in together before they get married, Miguel tells Dexter about a husband who has gotten away with killing two of his wives for financial gain. Meanwhile, Debra works with Anton, her confidential informant, to track down one of Freebo\'s criminal confidants. ', 'Y', 'N', 8.6),
	('Dexter', 'Si Se Puede', 3, 6, 'Yes', 'Yes', 'No', 2, 11, 2008, 'Miguel is put on test by Dexter. Meanwhile, Rita is forced to reconsider her choices. The Skinner strikes again, this time killing the young boy who worked as Freebo\'s doorman and Debra begins to feel like she had some part in it.', 'Y', 'N', 8.4),
	('Dexter', 'Easy As Pie', 3, 7, 'Yes', 'Yes', 'No', 9, 11, 2008, 'Dexter begins working with Miguel but they quickly have differences in selecting a potential new victim. Meanwhile Rita discovers that Miguel\'s wife suspects him of an affair. And an old friend of Dexter\'s asks for help in ending her life.', 'Y', 'N', 8.6),
	('Dexter', 'The Damage A Man Can Do', 3, 8, 'Yes', 'Yes', 'No', 16, 11, 2008, 'Dexter undertakes to teach Miguel the Code, but doesn\'t realize he\'s whetting his partner\'s thirst for blood. Meanwhile, Debra is one step closer to finding the Skinner but a secret revealed about Anton sends him packing.', 'Y', 'N', 8.7),
	('Dexter', 'About Last Night', 3, 9, 'Yes', 'Yes', 'No', 23, 11, 2008, 'The friendship between Dexter and Miguel become strained even as Rita resolves to confront Miguel about his suspected infidelity. Meanwhile, Debra searches furiously for Anton when it\'s revealed that he was abducted by the Skinner.', 'Y', 'N', 8.9),
	('Dexter', 'Go Your Own Way', 3, 10, 'Yes', 'Yes', 'No', 30, 11, 2008, 'A series of chess-like moves ensues when Dexter and Miguel vie for the upper hand, with Miguel winning Rita\'s affection by presenting her with a lavish wedding gift. Elsewhere, Debra wonders if her relationship with Anton is worth the trouble.', 'Y', 'N', 9.1),
	('Dexter', 'I Had A Dream', 3, 11, 'Yes', 'Yes', 'No', 7, 12, 2008, 'While preparing for his big wedding day, Dexter has to figure out a way to remove Miguel from his life for good. In the meantime, Rita has troubles of her own, when Syl reveals that Miguel has been seeing one of his old flames. Debra finds a new clue that brings her even closer to catching the Skinner.', 'Y', 'N', 8.9),
	('Dexter', 'Do You Take Dexter Morgan', 3, 12, 'Yes', 'Yes', 'No', 14, 12, 2008, 'It is the day before Dexter\'s wedding and Dexter must deal with two people targeting him, while preparing for his special occasion. Meanwhile, Angel tells Deb he\'s put her in for a promotion, but after he finds out some information her shield may be gone before she gets it.', 'Y', 'N', 8.9),
	('Dexter', 'Living The Dream', 4, 1, 'Yes', 'Yes', 'No', 27, 9, 2009, 'The pressures of fatherhood threaten to bring Dexter\'s world crashing down. In his carelessness, Dexter realizes that he\'s misplaced crucial evidence, something that could expose his dark side to the world. But his search will have to wait, as Miami Metro\'s two simultaneous murder cases continue to escalate. Their top priority is to solve \'The Vacation Murders\', a series of robberies gone bad that threaten Miami\'s lucrative tourist industry. Lundy, however, remains convinced that the bigger problem is dealing with the Trinity Killer, who unbeknownst to them is already stalking his next victim. Dexter has to weave a web of lies to extract himself from his duties, hoping to bury his secret before someone else finds it first.', 'Y', 'N', 8.8),
	('Dexter', 'Remains To Be Seen', 4, 2, 'Yes', 'Yes', 'No', 4, 10, 2009, 'Dexter misplaces evidence which could expose his secret. Meanwhile, Miami Metro must juggle two serial killers at the same time, as the Vacation Murders might bring the city\'s tourism industry to a grinding halt.', 'Y', 'N', 8.8),
	('Dexter', 'Blinded By The Light', 4, 3, 'Yes', 'Yes', 'No', 11, 10, 2009, 'Dexter is hampered by his neighborhood\'s increased vigilance due to vandalism, his temporary inability to drive himself anywhere, and his admiration for the killing technique of the artful Trinity Killer.', 'Y', 'N', 8.4),
	('Dexter', 'Dex Takes A Holiday', 4, 4, 'Yes', 'Yes', 'No', 18, 10, 2009, 'Dexter gets some much-needed R&R time with Rita and the kids out of town, leading to his stalking of a new victim until he unexpectedly begins to empathize with his target, a cop that murdered her family.', 'Y', 'N', 9.2),
	('Dexter', 'Dirty Harry', 4, 5, 'Yes', 'Yes', 'No', 25, 10, 2009, 'Recent events spur Dexter into his own investigation of the Trinity killer. His motivations are now personal, and the clock is ticking. But the closer Dexter gets, the more he realizes that Trinity is unlike any monster he\'s previously encountered.', 'Y', 'N', 9),
	('Dexter', 'If I Had A Hammer', 4, 6, 'Yes', 'Yes', 'No', 1, 11, 2009, 'Dexter knows it\'s only a matter of time before Miami Metro discovers the Trinity Killer\'s latest handiwork. Therefore, he has to work doubly hard to stay one step ahead of their investigation. Dexter has begun to realize that the closer he gets to Trinity, the more he stands to learn from this very different beast.', 'Y', 'N', 8.8),
	('Dexter', 'Slack Tide', 4, 7, 'Yes', 'Yes', 'No', 8, 11, 2009, 'Dexter finds himself enjoying a brief moment of tranquility. He\'s finally managed to strike a balance between work, family and other pursuits. But he\'s keenly aware that times like these aren\'t meant to last. When Miami Metro discovers a string of murders connected to a prominent photographer, Dexter sees an opportunity for a clean ki', 'Y', 'N', 8.6),
	('Dexter', 'Road Kill', 4, 8, 'Yes', 'Yes', 'No', 15, 11, 2009, 'Dexter has always known his father\'s Code was meant to protect him from exposure. But after committing a serious mistake, he wonders if it could have been designed to protect him from something even more dangerous human emotion. When he discovers that Trinity is planning an out-of-town trip, Dexter sees an opportunity to ride along and gain insight into the mind of a fellow monster.', 'Y', 'N', 8.6),
	('Dexter', 'Hungry Man', 4, 9, 'Yes', 'Yes', 'No', 22, 11, 2009, 'For most people, Thanksgiving is a time for traditions and family. But for Dexter, it\'s an opportunity to get closer to his most dangerous adversary yet. As Dexter gains insight into Arthur\'s psychology by studying those closest to him, he finds himself drawn into a bizarre and twisted world.', 'Y', 'N', 9.4),
	('Dexter', 'Lost Boys', 4, 10, 'Yes', 'Yes', 'No', 29, 11, 2009, 'Dexter finally believes he understands the beast known as Trinity. But when a ten-year old boy goes missing, Dexter is forced to question everything he\'s learned up to this point.', 'Y', 'N', 9.2),
	('Dexter', 'Hello, Dexter Morgan', 4, 11, 'Yes', 'Yes', 'No', 6, 12, 2009, 'Miami Metro is just one step away from discovering the identity of the Trinity Killer. And Dexter can\'t let that happen. Dexter must take drastic action to buy himself time to deal with Trinity in his own fashion.  Arthur, who still can\'t understand why Dexter didn\'t simply turn him in, begins his own bloody investigation into Kyle Butler.', 'Y', 'N', 9.5),
	('Dexter', 'The Getaway', 4, 12, 'Yes', 'Yes', 'No', 13, 12, 2009, 'Dexter and Arthur find themselves on a collision course, as Debra unearths a shocking long-hidden truth, Rita admits her marriage to Dexter is troubled, and Batista and LaGuerta face the consequences of an ethics breach.', 'Y', 'N', 9.8),
	('Dexter', 'My Bad', 5, 1, 'Yes', 'Yes', 'No', 26, 9, 2010, 'Dexter must make a choice. Quinn stirs up trouble for Dexter but supports Deb.', 'Y', 'N', 9),
	('Dexter', 'Hello, Bandit', 5, 2, 'Yes', 'Yes', 'No', 3, 10, 2010, 'Dexter tries to focus on the children and fight his dark urges. Debra ends up on Quinn\'s doorstep.', 'Y', 'N', 8.3),
