	('Dexter', 'Take It!', 5, 8, 'Yes', 'Yes', 'No', 14, 11, 2010, 'Dexter and Lumen vet and stalk a violent killer. Debra gets into some unexpected trouble from the fallout of the Santa Muerte case', 'Y', 'N', 8.9),
