	('Dexter', 'In The Beginning', 5, 10, 'Yes', 'Yes', 'No', 28, 11, 2010, 'Homicide uncovers some key evidence linked to one of Dexter\'s and Lumen\'s prior victims. Debra identifies two more suspects in the case.', 'Y', 'N', 9),
	('Dexter', 'Hop A Freighter', 5, 11, 'Yes', 'Yes', 'No', 5, 12, 2010, 'Dexter must do damage control. Debra\'s speculation begins to take shape. Quinn becomes involved in a homicide.', 'Y', 'N', 8.9),
	('Dexter', 'The Big One', 5, 12, 'Yes', 'Yes', 'No', 12, 12, 2010, 'Dexter\'s situation grows desperate when he discovers that Lumen\'s been set up. Despite knowing he\'s being baited into a trap, Dexter risks everything to make sure he doesn\'t fall into the same mistake again. In the Barrel Girls case, Debra lets her personal feelings lead her instincts once she concludes that vigilantes are more than just a theory. Quinn finds himself in a troublesome situation, which only Dexter can help him out of.', 'Y', 'N', 8.9),
	('Dexter', 'Those Kinds Of Things', 6, 1, 'Yes', 'Yes', 'No', 2, 10, 2011, 'Dexter shows up at his 20th high-school reunion with the intention of confronting the former prom king. Elsewhere, an investigation into a heinous murder with religious overtones leads Dexter to ponder spiritual matters and wonder about his son\'s legacy. And an unexpected situation results in Debra becoming a hero. ', 'Y', 'N', 8.7),
	('Dexter', 'Once Upon A Time...', 6, 2, 'Yes', 'Yes', 'No', 9, 10, 2011, 'Brother Sam, a minister with a criminal history, is brought in by the homicide department to help solve a macabre murder, but Dexter sees him for what he really is, and it\'s definitely not a man of God. Elsewhere, Debra\'s sudden hero status elicits a pair of surprising proposals.', 'Y', 'N', 8.2),
	('Dexter', 'Smokey And The Bandit', 6, 3, 'Yes', 'Yes', 'No', 16, 10, 2011, 'Dexter is confronted with a sobering glimpse of his own potential future when a serial killer from his past makes a startling reappearance; Debra is uncomfortable in her new job; Travis struggles to keep his mentor happy, as he and Gellar prepare a new twisted tableau, ensuring Debra\'s next task will be a daunting one.', 'Y', 'N', 8.4),
	('Dexter', 'A Horse Of A Different Color', 6, 4, 'Yes', 'Yes', 'No', 23, 10, 2011, 'Much to his own surprise, an emergency with Harrison and a new tableau from Gellar and Travis has Dexter leaning on Brother Sam and an unexpected winged messenger for support as he questions the idea of faith; with proof of a religiously motivated killer, Homicide hunts for a zealot, with Debra giving her first official press conference.', 'Y', 'N', 8.6),
	('Dexter', 'The Angel Of Death', 6, 5, 'Yes', 'Yes', 'No', 30, 10, 2011, 'With the help of his newfound friend Brother Sam, Dexter wonders if there is light within him to counter the darkness, while the search for the Doomsday Killers takes him in a new direction; Batista and Quinn pay a visit to the university where Professor Gellar taught; due to departmental regulations following the shooting, Debra is forced to begin therapy.', 'Y', 'N', 8.1),
	('Dexter', 'Just Let Go', 6, 6, 'Yes', 'Yes', 'No', 6, 11, 2011, 'Dexter is caught up in a very personal case that awakens the needs of his Dark Passenger; Debra feels overwhelmed by her new Lieutenant duties, made all the more complicated when she finds out Quinn slept with a witness in the Doomsday case.', 'Y', 'N', 8.6),
	('Dexter', 'Nebraska', 6, 7, 'Yes', 'Yes', 'No', 13, 11, 2011, 'Dexter finds himself teamed up with a fellow Dark Passenger when he takes a road trip to Nebraska to tie up some loose ends from the past. Debra deals with the complications of her promotion as she leads the Doomsday investigation.', 'Y', 'N', 8),
	('Dexter', 'Sin Of Omission', 6, 8, 'Yes', 'Yes', 'No', 20, 11, 2011, 'Dexter uses lessons he learned from Brother Sam to follow up on some new leads in the Doomsday investigation. Debra butts heads with Captain LaGuerta over the case of a dead call girl.', 'Y', 'N', 8),
	('Dexter', 'Get Gellar', 6, 9, 'Yes', 'Yes', 'No', 27, 11, 2011, 'Dexter receives help from an unexpected source while hunting the Doomsday Killers and staying one step ahead of Homicide. Debra discovers something new about herself in therapy.', 'Y', 'N', 8.6),
	('Dexter', 'Ricochet Rabbit', 6, 10, 'Yes', 'Yes', 'No', 4, 12, 2011, 'Dexter tries to figure out the Doomsday Killers\' next victim before it\'s too late; Debra has a strong reaction to a crime scene, which leads her to the realization that she leans too heavily on her brother.', 'Y', 'N', 8.2),
	('Dexter', 'Talk To The Hand', 6, 11, 'Yes', 'Yes', 'No', 11, 12, 2011, 'Dexter finds that in order to catch the Doomsday Killers, he must create a macabre tableau of his own; Debra\'s battle with LaGuerta over the case of the dead call girl boils over, and her therapist makes an unnerving suggestion.', 'Y', 'N', 8.4),
	('Dexter', 'This Is The Way The World Ends', 6, 12, 'Yes', 'Yes', 'No', 18, 12, 2011, 'Dexter and Homicide race against a lunar eclipse to catch the Doomsday Killers before their final gruesome act. Debra struggles with a new emotional reality.', 'Y', 'N', 9.2),
	('Dexter', 'Are You...', 7, 1, 'Yes', 'Yes', 'No', 30, 9, 2012, 'Deb tries to cover up involvement in Travis\' murder. Detective Mike Anderson has an unfortunate run-in. Quinn and Batista make amends. LaGuerta rethinks the Bay Harbor Butcher case.', 'Y', 'N', 9.5),
	('Dexter', 'Sunshine And Frosty Swirl', 7, 2, 'Yes', 'Yes', 'No', 7, 10, 2012, 'Miami Metro sets out to unearth new evidence on a claim from a local convict that he has new information regarding a 15-year-old crime spree. Debra tries to cure Dexter of his killer tendencies.', 'Y', 'N', 8.9),
	('Dexter', 'Buck The System', 7, 3, 'Yes', 'Yes', 'No', 14, 10, 2012, 'Dexter tries to bring Debra on board with his new target. While the Ukrainian mob seeks revenge for the killing of one of their own, Quinn grows close to a dancer at their strip club. LaGuerta, convinced the Bay Harbor Butcher is still out there, attempts to enlist Batista to help her re-open the case.', 'Y', 'N', 8.8),
	('Dexter', 'Run', 7, 4, 'Yes', 'Yes', 'No', 21, 10, 2012, 'After capturing a deadly killer, things go awry for Miami Metro, sending Debra into a tailspin. In an effort to help his sister, Dexter enters into a dangerous game of cat and mouse, while the Ukrainian mob continues to seek revenge.', 'Y', 'N', 8.9),
	('Dexter', 'Swim Deep', 7, 5, 'Yes', 'Yes', 'No', 28, 10, 2012, 'While trying to uncover why someone was killed on his boat, Dexter must out-maneuver a vengeful Isaak. New leads are brought to light on the Wayne Randall case by Hannah McKay, Randall\'s alluring former accomplice.', 'Y', 'N', 8.6),
	('Dexter', 'Do The Wrong Thing', 7, 6, 'Yes', 'Yes', 'No', 4, 11, 2012, 'Debra gets to know a local crime writer who\'s dug up some incriminating dirt on Hannah McKay. Quinn gets an offer he tries to refuse and Batista is drawn to a new business opportunity. LaGuerta keeps digging into the Bay Harbor Butcher case. ', 'Y', 'N', 8.4),
	('Dexter', 'Chemistry', 7, 7, 'Yes', 'Yes', 'No', 11, 11, 2012, 'Quinn falls back into his old ways as he makes some questionable choices to protect Nadia. Things heat up as Dexter and Hannah grow closer, but when Sal Price discovers the two are involved, he wants the exclusive story. ', 'Y', 'N', 8.6),
	('Dexter', 'Argentina', 7, 8, 'Yes', 'Yes', 'No', 18, 11, 2012, 'Fresh out of jail, Isaak renews his pursuit of Dexter while Quinn continues his power struggle with the Koshkas. Dexter tries to keep Debra in the dark about his relationship with Hannah, but a surprise visit from Astor, Cody and Harrison throws a wrench into his plans. ', 'Y', 'N', 9),
	('Dexter', 'Helter Skelter', 7, 9, 'Yes', 'Yes', 'No', 25, 11, 2012, 'As Dexter scrambles to track down Isaak, a power struggle erupts among the Koshka Brotherhood, which could prove to Dexter\'s advantage. Meanwhile, Miami Dade tries to smoke out the Phantom Arsonist.', 'Y', 'N', 8.7),
	('Dexter', 'The Dark... Whatever', 7, 10, 'Yes', 'Yes', 'No', 2, 12, 2012, 'Dexter is unnerved when Hannah\'s father pays him a surprise visit the Phantom Arsonist\'s crimes become more vicious and Quinn defends Nadia\'s honor and finds himself in a volatile situation. Meanwhile, LaGuerta asks a former superior for help on the Bay Harbor Butcher case.', 'Y', 'N', 8.6),
	('Dexter', 'Do You See What I See', 7, 11, 'Yes', 'Yes', 'No', 9, 12, 2012, 'It\'s Christmas time, and Debra learns it may be better to receive when she gets a tip from Hannah\'s father... one that could lead to incriminating Dexter in a crime. Meanwhile, Dexter discovers that the man behind his mother\'s death has been released from prison.', 'Y', 'N', 9),
	('Dexter', 'Surprise, Motherfucker!', 7, 12, 'Yes', 'Yes', 'No', 16, 12, 2012, 'Dexter must protect himself when LaGuerta closes in on his secret.', 'Y', 'N', 9.3),
	('Dexter', 'A Beautiful Day', 8, 1, 'Yes', 'Yes', 'No', 30, 6, 2013, 'It\'s been 6 months since LaGuerta\'s murder and Dexter is still managing life as a dad, brother, and serial killer. Debra now works as a PI for a private firm and Batista has replaced her as Lieutenant. Meanwhile, Miami Metro investigates the murder of a man who has had pieces of his brain removed.', 'Y', 'N', 8.7),
	('Dexter', 'Every Silver Lining...', 8, 2, 'Yes', 'Yes', 'No', 7, 7, 2013, 'Miami Metro continues their hunt for the Brain Surgeon, while Dr. Vogel enlists Dexter to do her bidding based on her own personal experience with her previous patients. Debra continues to track down her PI case and has to take matters into her own hands.', 'Y', 'N', 8.2),
	('Dexter', 'What\'s Eating Dexter Morgan', 8, 3, 'Yes', 'Yes', 'No', 14, 7, 2013, 'Dexter continues his manhunt for the Brain Surgeon. Dr. Vogel tries to prove to Dexter that he\'s perfect as a psychopath. Debra\'s PTSD kicks in and she makes a desperate plea to confess to LaGuerta\'s murder.', 'Y', 'N', 8.3),
	('Dexter', 'Scar Tissue', 8, 4, 'Yes', 'Yes', 'No', 21, 7, 2013, 'Dexter tracks down another potential serial killer from Dr. Vogel\'s list. Quinn celebrates passing the Sergeant\'s exam by defending Debra\'s honor in a fight. Dr. Vogel begins treating Debra for her PTSD.', 'Y', 'N', 8.2),
	('Dexter', 'This Little Piggy', 8, 5, 'Yes', 'Yes', 'No', 28, 7, 2013, 'Dr. Vogel gets abducted by the Brain Surgeon, while Dexter and Debra try and rescue her. Masuka finds out he has a daughter.', 'Y', 'N', 8),
	('Dexter', 'A Little Reflection', 8, 6, 'Yes', 'Yes', 'No', 4, 8, 2013, 'Dexter monitors a young psychopath to see if he is suited for his table. Dexter and Debra finally get back to normal, but are surprised by his ex, Hannah.', 'Y', 'N', 7.9),
	('Dexter', 'Dress Code', 8, 7, 'Yes', 'Yes', 'No', 11, 8, 2013, 'Dexter hunts down Hannah to figure out why she\'s back in Miami. Dexter also takes on a protege and starts teaching him the Code.', 'Y', 'N', 7.7),
	('Dexter', 'Are We There Yet', 8, 8, 'Yes', 'Yes', 'No', 18, 8, 2013, 'Dexter tracks down his protege in the belief that he murdered his neighbor. Meanwhile, Dexter tries to help Hannah escape the country.', 'Y', 'N', 8.2),
	('Dexter', 'Make Your Own Kind Of Music', 8, 9, 'Yes', 'Yes', 'No', 25, 8, 2013, 'Dexter investigates a murder that hits close to home. Meanwhile, Dr. Vogel gets the surprise of her life when someone from her past returns.', 'Y', 'N', 7.4),
	('Dexter', 'Goodbye Miami', 8, 10, 'Yes', 'Yes', 'No', 8, 9, 2013, 'Dexter enlists Dr. Vogel\'s help to lure the Brain Surgeon to a location in order to get him on the table. Later, an important person in Dexter\'s life is murdered before his eyes.', 'Y', 'N', 6.9),
	('Dexter', 'Monkey In A Box', 8, 11, 'Yes', 'Yes', 'No', 15, 9, 2013, 'Dexter is torn between fleeing the country with Hannah and Harrison, and taking Saxon out once and for all.', 'Y', 'N', 7.3),
	('Dexter', 'Remember The Monsters', 8, 12, 'Yes', 'Yes', 'No', 22, 9, 2013, 'With a hurricane threatening Miami, Dexter becomes determined to end things his way.', 'Y', 'N', 4.8),
	('Dig', 'Pilot', 1, 1, 'Yes', 'Yes', 'Yes', 5, 3, 2015, 'In the premiere, FBI agent Peter Donnelly unearths an international mystery while investigating the murder of a young American in Jerusalem.', 'Y', 'N', 7.5),
	('Dig', 'Catch You Later', 1, 2, 'Yes', 'Yes', 'Yes', 12, 3, 2015, 'Peter searches for the murderer while also pursuing Yussef Khalid; and forms an uneasy alliance with Det. Golan Cohen while dealing with an unexpected revelation. In other events, Avram begins his journey to Israel with the red heifer; and Billingham and his disciplines prepare Josh for a life-changing event.', 'Y', 'N', 7.7),
	('Dig', 'Meet The Rosenbergs', 1, 3, 'Yes', 'Yes', 'Yes', 19, 3, 2015, 'Peter\'s pursuit of Khalid dead ends; and he and Cohen follow clues found in Emma\'s journal. In other events, Debbie takes Josh for an unauthorized outing; and Avram continues his journey to Jerusalem.', 'Y', 'N', 8),
	('Dig', 'Prayer Of David', 1, 4, 'Yes', 'Yes', 'Yes', 26, 3, 2015, 'Peter\'s discovery of an ancient coded secret leads to a race to find the final stone Debbie faces the consequences for her attempted kidnapping of Josh and Avram is shadowed by a deadly assassin.', 'Y', 'N', 8.1),
	('Dig', 'Emma Wilson\'s Father', 1, 5, 'Yes', 'Yes', 'Yes', 2, 4, 2015, 'Peter delves into Emma\'s past, which leads to the discovery of a long-hidden, ancient symbol; someone from Debbie\'s past attempts to rescue her; and Lynn\'s life is put in jeopardy.', 'Y', 'N', 8.2),
	('Dig', 'The Well Of Souls', 1, 6, 'Yes', 'Yes', 'Yes', 9, 4, 2015, 'Cohen arrests Emma\'s suspected killer. Peter makes a startling discovery. Avram and the red heifer are kidnapped in Croatia, and Billingham tries to prevent Debbie and Josh from exposing his secrets.', 'Y', 'N', 8.3),
	('Dig', 'Trust No One', 1, 7, 'Yes', 'Yes', 'Yes', 16, 4, 2015, 'Peter turns to Golan for help after a breakthrough in the Emma Wilson case; Ridell pressures Lynn to get Peter out of the country; and Debbie has to make a dangerous trade with Tad Billingham if she hopes to avoid bloodshed. In other events, Rabbi Lev and a new partner head to the underground tunnels to carry out their mission.', 'Y', 'N', 8.2),
	('Dig', 'Sisters Of Dinah', 1, 8, 'Yes', 'Yes', 'Yes', 23, 4, 2015, 'Lynn suspects that there may be a mole at the consulate; Margrove and Peter both head to a convent, but they have different goals; and Debbie returns to the compound seeking vengeance.', 'Y', 'N', 8.2),
	('Dig', 'Jehoshaphat', 1, 9, 'Yes', 'Yes', 'Yes', 30, 4, 2015, 'An ancient religious sect is ready to enact its plan. Peter partners with unlikely allies. Lynn realizes the depth of the conspiracy while investigating Ridell. Golan tries to crack more clues from the Donaldson case and Avram moves to protect his valuable asset.', 'Y', 'N', 8.5),
	('Dig', 'Armageddon Protocol', 1, 10, 'Yes', 'Yes', 'Yes', 7, 5, 2015, 'Peter races to stop the Order of Moriah\'s plans of destroying the Temple Mount.', 'Y', 'N', 7.9),
	('DreamWorks Dragons', 'How To Start A Dragon Academy', 1, 1, 'Yes', 'Yes', 'NA', 7, 8, 2012, 'Dragons are still dragons, and as a result, they are causing mayhem in the Isle of Berk. Stoick is reconsidering allowing the dragons to roam freely on Berk. It is up to Hiccup and his friends to convince Stoick otherwise.', 'Y', 'N', 8),
	('DreamWorks Dragons', 'Viking For Hire', 1, 2, 'Yes', 'Yes', 'NA', 7, 8, 2012, 'The peace with the dragons has put Gobber out of business, since his job was making weapons to fight dragons. Stoick asks Hiccup to help find a new job for him ... but unfortunately a change of profession does not seem to go well with Gobber.', 'Y', 'N', 7.7),
	('DreamWorks Dragons', 'Animal House', 1, 3, 'Yes', 'Yes', 'NA', 4, 9, 2012, 'The dragons unintentionally reduce Berk\'s food productivity by still scaring the living daylights out of the local livestock, and with the first winter storm coming, the dragon-riding Viking youths of Berk must try and familiarize the local animals with their Dragon companions.', 'Y', 'N', 8.2),
	('DreamWorks Dragons', 'The Terrible Twos', 1, 4, 'Yes', 'Yes', 'NA', 11, 9, 2012, 'Hiccup finds an injured baby dragon. Toothless does not warm up to the energetic newcomer and the baby\'s angry mother arrives looking for her lost son.', 'Y', 'N', 7.6),
	('DreamWorks Dragons', 'In Dragons We Trust', 1, 5, 'Yes', 'Yes', 'NA', 18, 9, 2012, 'The Dragons are blamed for vandalism, and Hiccup tries to prove their innocence by forming a night patrol called the \'Dragon United Monitoring Brigade\' (DUMB), but not in time to prevent the dragons\' banishment from the island. Hiccup begins to suspect that Mildew is responsible for the scapegoat.', 'Y', 'N', 7.9),
	('DreamWorks Dragons', 'Alvin And The Outcasts', 1, 6, 'Yes', 'Yes', 'NA', 25, 9, 2012, 'Hiccup had discovered Mildew framed the dragons but has destroyed all evidence of it, therefore he must prove of their innocence in order to get them back. Meanwhile, Alvin the Treacherous of the Outcast Tribe are on the mission to raid the Isle of Berk in order to find and capture the \'Dragon Conqueror\'.', 'Y', 'N', 8),
	('DreamWorks Dragons', 'How To Pick Your Dragon', 1, 7, 'Yes', 'Yes', 'NA', 3, 10, 2012, 'Stoick is in need of learning how to ride a dragon, and he quickly insists on riding Toothless all the time. Meanwhile, a mysterious dragon has been attacking fishing ships.', 'Y', 'N', 8.2),
	('DreamWorks Dragons', 'Potrait Of Hiccup As A Buff Man', 1, 8, 'Yes', 'Yes', 'NA', 10, 10, 2012, 'After getting his picture painted with his father, Hiccup begins to fear that he is not Stoick\'s ideal son, so to prove himself, he and his friends set out on a treasure hunt that even Stoick had not been able to complete.', 'Y', 'N', 8.4),
	('DreamWorks Dragons', 'Dragon Flower', 1, 9, 'Yes', 'Yes', 'NA', 17, 10, 2012, 'After Mildew poisons all the dragons on the island, he is forced to help Hiccup, Stoick, and Gobber find and capture the ferocious Scauldron in order to get the antidote.', 'Y', 'N', 7.8),
	('DreamWorks Dragons', 'Heather Report - 1', 1, 10, 'Yes', 'Yes', 'NA', 14, 11, 2012, 'The teens of Berk find a mysterious girl named Heather on Thor\'s Beach. While Hiccup and the other teens openly welcome the newcomer, Astrid\'s jealousy turns to suspicion when she notices Heather is taking an unusual interest in the Book of Dragons.', 'Y', 'N', 8.1),
	('DreamWorks Dragons', 'Heather Report - 2', 1, 11, 'Yes', 'Yes', 'NA', 21, 11, 2012, 'Heather\'s betrayal to Berk caused the Book of Dragons to fall into Alvin the Treacherous\' hands, and Heather\'s imprisonment on Berk. In order to get the book back from Alvin, Astrid disguises herself as Heather and goes into Outcast Territory. Towards the end of her mission, Astrid learns and confirms Heather\'s true motives for helping the Outcasts.', 'Y', 'N', 7.1),
	('DreamWorks Dragons', 'Thawfest', 1, 12, 'Yes', 'Yes', 'NA', 28, 11, 2012, 'Berk\'s annual festive sporting competition, the Thawfest games, is underway and all the teens are participating with the dragons for the first time in Viking history. Hiccup is determined to finally best Snotlout, who constantly gloats about being the reigning Thawfest champion, but Hiccup\'s successes begin to make him arrogant and boastful, much to Astrid\'s displeasure and disappointment.', 'Y', 'N', 7.9),
	('DreamWorks Dragons', 'When Lightning Strikes', 1, 13, 'Yes', 'Yes', 'NA', 5, 12, 2012, 'Sudden lightning storms are endangering the residents of Berk and it is believed Thor is angry at the island. Mildew leads the superstitious villagers into blaming Toothless, \'the unholy offspring of lightning and death itself\', for the lightning, leaving Hiccup to find the true answers for Thor\'s sudden destructive anger.', 'Y', 'N', 8),
	('DreamWorks Dragons', 'What Flies Beneath', 1, 14, 'Yes', 'Yes', 'NA', 6, 2, 2013, 'A rogue dragon a Whispering Death  shows up in Berk, tearing up the village. He\'s on a mission to find Toothless and settle a score. Despite Hiccup\'s efforts to help, Toothless insists on facing the dragon alone. But unlike their past battle, Toothless\'s inability to fly my prove to be his undoing', 'Y', 'N', 7.6),
	('DreamWorks Dragons', 'Twinsanity', 1, 15, 'Yes', 'Yes', 'NA', 13, 2, 2013, 'Dagur the Deranged visits Berk to renew a peace treaty between the Berserkers and Berk, and the dragons are put into hiding to dispel rumours that Berk is training a dragon army. But when Ruffnut and Tuffnut begin to fight, their dragon, Barf and Belch, is left out of control. The Viking youths must bring the twins back together to control their dragon and avoid provoking Dagur to war.', 'Y', 'N', 7.4),
	('DreamWorks Dragons', 'Defiant One', 1, 16, 'Yes', 'Yes', 'NA', 20, 2, 2013, 'Caught in a waterspout, Toothless\' prosthetic tail is damaged, rendering him unable to fly and thus leaving him, Hiccup and Snotlout stranded on Outcast Island. The three must work together to repair the damage, overcome the rivalry between Hiccup and Snotlout and return home to Berk before they are captured by Alvin and the Outcasts.', 'Y', 'N', 7.3),
	('DreamWorks Dragons', 'Breakneck Bog', 1, 17, 'Yes', 'Yes', 'NA', 27, 2, 2013, 'When Hiccup discovers Trader Johann\'s ship was shipwrecked in a rumored haunted bog with a gift made for him by his mother, he will stop at nothing to retrieve it.', 'Y', 'N', 7.5),
	('DreamWorks Dragons', 'Gem Of A Different Color', 1, 18, 'Yes', 'Yes', 'NA', 6, 3, 2013, 'When Snotlout and the villagers mistake dragon eggs for gems that bring good fortune, Fishlegs, who is responsible for the eggs\' discovery, must take a stand against Snotlout and reunite the eggs with their Changewing mothers before they destroy Berk.', 'Y', 'N', 7.4),
	('DreamWorks Dragons', 'We Are Family - 1', 1, 19, 'Yes', 'Yes', 'NA', 13, 3, 2013, 'During Berk\'s annual Bork week celebrations, Hiccup is granted access to Bork the Bold\'s private and personal archives. When he finds information and a map about an island inhabited by Night Furies within Bork\'s notes, Hiccup is determined to bring Toothless to his family. ', 'Y', 'N', 7.5),
	('DreamWorks Dragons', 'We Are Family - 2', 1, 20, 'Yes', 'Yes', 'NA', 20, 3, 2013, 'Mildew has betrayed the Vikings of Berk and allowed Alvin the Treacherous to kidnap Hiccup and Toothless. Astrid and Stoick must rescue them from Outcast Island along with help from a new friend.', 'Y', 'N', 7.6),
	('DreamWorks Dragons', 'Live And Let Fly', 2, 1, 'Yes', 'Yes', 'NA', 19, 9, 2013, 'Certain that Alvin is planning an attack on Berk, Stoick institutes flight restrictions on the dragon academy. Hiccup, certain that Alvin will be using his newfound dragon-training knowledge to bolster his attack, forms a secret \'Dragon Flight Club\' in order to train the kids to defend Berk against Alvin\'s dragon army.', 'Y', 'N', 7.6),
	('DreamWorks Dragons', 'The Iron Gronkle', 2, 2, 'Yes', 'Yes', 'NA', 26, 9, 2013, 'Meatlug ingests magnetic rocks, causing destruction throughout the town.', 'Y', 'N', 7.2),
	('DreamWorks Dragons', 'The Night And The Fury', 2, 3, 'Yes', 'Yes', 'NA', 3, 10, 2013, 'The kids go on a dragon survival-training mission to Dragon Island, where they encounter Dagur, the Berserker Chief, who has become obsessed with hunting the Night Fury.', 'Y', 'N', 7.6),
	('DreamWorks Dragons', 'Tunnel Vision', 2, 4, 'Yes', 'Yes', 'NA', 10, 10, 2013, 'Hiccup discovers that a water shortage in Berk has been caused by the Outcasts\' plan to hide Whispering Death eggs under Berk.', 'Y', 'N', 7.5),
	('DreamWorks Dragons', 'Race To Fireworm Island', 2, 5, 'Yes', 'Yes', 'NA', 17, 10, 2013, 'Snotlout is concerned when his dragon\'s flame goes out and the kids have to figure out how to reignite it before it\'s too late.', 'Y', 'N', 7.5),
	('DreamWorks Dragons', 'Fright Of Passage', 2, 6, 'Yes', 'Yes', 'NA', 24, 10, 2013, 'Hiccup must help Astrid face her fear of the terrifying Flightmare, a ghostly dragon that seemingly \'froze\' her uncle with fear, shaming her family name. With Fishlegs\' help, they discover that there\'s more to the Flightmare than meets the eye.', 'Y', 'N', 7.5),
	('DreamWorks Dragons', 'Worst In Show', 2, 7, 'Yes', 'Yes', 'NA', 7, 11, 2013, 'A Terrible Terror training competition leads to a heated rivalry between Fishlegs and Snotlout, allowing Alvin to kidnap Meatlug. The kids must use their newly trained Terrors to rescue their friend.', 'Y', 'N', 7.4),
	('DreamWorks Dragons', 'Appetite For Destruction', 2, 8, 'Yes', 'Yes', 'NA', 14, 11, 2013, 'When wild dragons start overwhelming Berk, Hiccup and Toothless discover islands are disappearing throughout the archipelago. When Hiccup and Toothless investigate the cause, they then encounter the Screaming Death.', 'Y', 'N', 7.3),
