	('Elementary', 'Dead Clade Walking', 2, 14, 'Yes', 'Yes', 'No', 30, 1, 2014, 'When Joan revisits one of Sherlocks cold cases, she discovers an unsolved murder is connected to a rare prehistoric fossil. Meanwhile, Sherlock finds himself in uncharted territory when his duties as a sobriety sponsor cross his personal boundaries.', 'Y', 'N', 7.6),
	('Elementary', 'Corpse De Ballet', 2, 15, 'Yes', 'Yes', 'No', 6, 2, 2014, 'Holmes latest investigation takes him inside a professional dance company when an up-and-coming ballerina is murdered. Meanwhile, Watson embarks on a solo enquiry to find a homeless veteran when his friend alleges he was abducted.', 'Y', 'N', 8.1),
	('Elementary', 'The One Percent Solution', 2, 16, 'Yes', 'Yes', 'No', 27, 2, 2014, 'Tensions rise when Holmes and Watson are forced to partner with Gareth Lestrade, Sherlocks former Scotland Yard colleague, on a bombing investigation.', 'Y', 'N', 7.9),
	('Elementary', 'Ears To You', 2, 17, 'Yes', 'Yes', 'No', 6, 3, 2014, 'Holmes and Watson consult on a case in which a man suspected of murdering his wife years ago receives a ransom demand for her safe return. Meanwhile, Lestrade overstays his welcome at the brownstone and seems unwilling to leave.', 'Y', 'N', 7.9),
	('Elementary', 'The Hound Of The Cancer Cells', 2, 18, 'Yes', 'Yes', 'No', 13, 3, 2014, 'When a famous cancer researcher is found dead, Holmes and Watson must determine if the scientists untimely demise was tied to his latest cutting-edge invention. Meanwhile, Bell is finally cleared to re-enter the field.', 'Y', 'N', 7.9),
	('Elementary', 'The Many Mouths Of Aaron Colville', 2, 19, 'Yes', 'Yes', 'No', 3, 4, 2014, 'A serial killer known for biting his victims appears to be killing again, even though he was presumed dead.', 'Y', 'N', 8),
	('Elementary', 'No Lack Of Void', 2, 20, 'Yes', 'Yes', 'No', 10, 4, 2014, 'A pickpocket dies of anthrax poisoning, putting Holmes and Watson on the trail of the toxins source in order to prevent more deaths.', 'Y', 'N', 8),
	('Elementary', 'The Man With The Twisted Lip', 2, 21, 'Yes', 'Yes', 'No', 24, 4, 2014, 'When Sherlocks brother Mycroft makes a surprise return to New York, his motivations cause discord between Sherlock and Joan. Meanwhile, a missing person case takes Sherlock and Joan inside the world of unmanned aeronautics.', 'Y', 'N', 8.2),
	('Elementary', 'Paint It Black', 2, 22, 'Yes', 'Yes', 'No', 1, 5, 2014, 'Business becomes personal for Sherlock when he is forced to partner with his estranged brother, Mycroft, to solve a case with life-or-death consequences.', 'Y', 'N', 8.6),
	('Elementary', 'Art In The Blood', 2, 23, 'Yes', 'Yes', 'No', 8, 5, 2014, 'Holmes and Watson come into contact with MI-6, the British intelligence agency, when a standard murder investigation turns out to have international and political implications. Meanwhile, in the wake of a crisis, Watson reevaluates her relationships with Sherlock and his brother, Mycroft.', 'Y', 'N', 8.5),
	('Elementary', 'The Grand Experiment', 2, 24, 'Yes', 'Yes', 'No', 15, 5, 2014, 'Rising tension between Sherlock and Joan brings their partnership to a crossroads, but they endeavor to put their differences aside while they help Sherlock\'s brother, Mycroft, who faces accusations of treason and murder.', 'Y', 'N', 8.5),
	('Elementary', 'Enough Nemesis To Go Around', 3, 1, 'Yes', 'Yes', 'No', 30, 10, 2014, 'Sherlock returns to New York with a new apprentice and a renewed interest in working with the NYPD after being fired by Londons MI6. However, Gregson wont let him resume consulting for the department without permission from his former partner, Joan, the NYPDs new go-to private investigator.', 'Y', 'N', 8.1),
	('Elementary', 'The Five Orange Pipz', 3, 2, 'Yes', 'Yes', 'No', 6, 11, 2014, 'When Sherlock and Joan join forces on a double homicide, Sherlocks new apprentice threatens the investigation when she allows her jealousy of Sherlock and Joan\'s work rapport to override her better judgment.', 'Y', 'N', 7.8),
	('Elementary', 'Just A Regular Irregular', 3, 3, 'Yes', 'Yes', 'No', 13, 11, 2014, 'Sherlock helps a math genius from his network of \'Irregulars\' experts after he stumbles upon a body while participating in a math puzzle competition. Joan attempts to extend an olive branch after she learns about Kittys past.', 'Y', 'N', 8.3),
	('Elementary', 'Bella', 3, 4, 'Yes', 'Yes', 'No', 20, 11, 2014, 'Sherlock takes on the case of a stolen artificial intelligence software program, but seeks out Joan when he\'d rather disprove the computer\'s abilities than find the thief. Joan meets Sherlock head-on when she finds out he\'s met with Andrew without telling her.', 'Y', 'N', 8.1),
	('Elementary', 'Rip Off', 3, 5, 'Yes', 'Yes', 'No', 27, 11, 2014, 'Holmes and Kitty investigate the murder of a postal store owner whose death is connected to the illegal diamond trade. Meanwhile, Gregson\'s career is placed in jeopardy when he hits a fellow NYPD officer. ', 'Y', 'N', 7.8),
	('Elementary', 'Terra Pericolosa', 3, 6, 'Yes', 'Yes', 'No', 4, 12, 2014, 'Holmes and Watson search for a thief who committed murder to steal a rare map. Meanwhile, Watson becomes concerned with Sherlocks escalating interference into Kittys burgeoning personal life.', 'Y', 'N', 7.9),
	('Elementary', 'The Adventure Of The Nutmeg Concoction', 3, 7, 'Yes', 'Yes', 'No', 11, 12, 2014, 'A bored Sherlock forces his investigative services onto Joan, who is trying to locate a woman who has been missing for five years, and the only clue is the smell of nutmeg at the site of her disappearance. Meanwhile, Joans bond with her long-distance boyfriend, Andrew, is tested when a man from her past reappears and asks for her help.', 'Y', 'N', 8.1),
	('Elementary', 'End Of Watch', 3, 8, 'Yes', 'Yes', 'No', 18, 12, 2014, 'Holmes and Watson join forces with the NYPD after a police officer is murdered. Also, Sherlock searches for the creator of a recovery blog who is posting personal statements he has made in sobriety meetings.', 'Y', 'N', 8.5),
	('Elementary', 'The Eternity Injection', 3, 9, 'Yes', 'Yes', 'No', 8, 1, 2015, 'When Watson joins forces with Holmes and Kitty to locate a missing nurse she used to work with, the womans trail leads them to another person who has recently disappeared.', 'Y', 'N', 8),
	('Elementary', 'Seed Money', 3, 10, 'Yes', 'Yes', 'No', 15, 1, 2015, 'While Kitty tries to find a runaway teen, Sherlock and Joan work a case in which the murder of a brilliant bioengineer looks to be at the hands of a drug cartel. Also, Joan makes a major life decision but worries it will impact Sherlock negatively, not knowing that Sherlock has big news of his own.', 'Y', 'N', 8.4),
	('Elementary', 'The Illustrious Client', 3, 11, 'Yes', 'Yes', 'No', 22, 1, 2015, 'Watson begins her new job as an in-house investigator for an insurance firm. However, her attention shifts to a case that is personal for both her and Holmes when they join forces to eliminate an imminent threat to Kitty.', 'Y', 'N', 8.8),
	('Elementary', 'The One That Got Away', 3, 12, 'Yes', 'Yes', 'No', 29, 1, 2015, 'As Kitty begins to unravel due to the imminent threat to her safety, Sherlock and Joan intensify their efforts to help her. Also, the origin of Sherlock and Kittys relationship is revealed.', 'Y', 'N', 9.2),
	('Elementary', 'Hemlock', 3, 13, 'Yes', 'Yes', 'No', 5, 2, 2015, 'When a debt collector is murdered, Holmes and Watson attempt to narrow down a suspect pool of thousands of consumers who owed the man money. Meanwhile, Watsons relationship with Andrew progresses when he asks her to meet his father for the first time.', 'Y', 'N', 8.4),
	('Elementary', 'The Female Of The Species', 3, 14, 'Yes', 'Yes', 'No', 12, 2, 2015, 'An unexpected event brings Watson into contact again with Elana March, the crime boss she brought to justice. Also, with Watson distracted, Holmes partners with Detective Bell to investigate a theft at a local zoo.', 'Y', 'N', 8.5),
	('Elementary', 'When Your Number\'s Up', 3, 15, 'Yes', 'Yes', 'No', 19, 2, 2015, 'Holmes and Watson follow a blood trail into the world of wrongful death compensation when they investigate a series of murders in which the killer leaves envelopes of cash on the victims. Also, Holmes makes a generous gesture towards Watson as she suffers through the aftermath of a personal crisis.', 'Y', 'N', 8.3),
	('Elementary', 'For All You Know', 3, 16, 'Yes', 'Yes', 'No', 5, 3, 2015, 'When Holmes is implicated in the murder of a woman who was killed during the height of his addiction, he investigates himself to find their connection. As Holmes retraces his steps with Watsons help, the clues make his confidence in his own character waver.', 'Y', 'N', 8.4),
	('Elementary', 'T-Bone And The Iceman', 3, 17, 'Yes', 'Yes', 'No', 12, 3, 2015, 'Holmes and Watson investigate a murder that initially looks like a road rage incident, but takes a new direction when they learn the victim was flash-frozen at the time of death. Also, when Watsons mother finds out Joans brother is cheating on his wife, she puts Joan in the awkward position of confronting him about the affair.', 'Y', 'N', 7.9),
	('Elementary', 'The View From Olympus', 3, 18, 'Yes', 'Yes', 'No', 2, 4, 2015, 'When a driver for a ridesharing company is intentionally run over by a city cab, Holmes and Watson wonder if its a case of professional jealousy. A casual romance Holmes has with one of his longtime \'Irregular\' consultants becomes complicated when the woman makes a shocking request.', 'Y', 'N', 8.2),
	('Elementary', 'One Watson, One Holmes', 3, 19, 'Yes', 'Yes', 'No', 9, 4, 2015, 'Holmes and Watson find themselves in the middle of a civil war being fought on the Internet when a member of Everyone, the anonymous hacker group they periodically work with, is murdered.', 'Y', 'N', 7.8),
	('Elementary', 'A Stitch In Time', 3, 20, 'Yes', 'Yes', 'No', 16, 4, 2015, 'Holmes and Watson investigate the murder of a professional skeptic, a man who debunked paranormal, religious and scientific phenomenon for a living. The case becomes urgent when his homicide reveals a potential threat to homeland security. Also, Captain Gregsons daughter and fellow NYPD officer, Hannah, asks Watson for help with one of her cases.', 'Y', 'N', 8.3),
	('Elementary', 'Under My Skin', 3, 21, 'Yes', 'Yes', 'No', 23, 4, 2015, 'When two New York City paramedics are killed during a kidnapping, Holmes and Watson join the manhunt to find the murderer and the woman he abducted. Also, Holmes learns important information about his recovery sponsor, Alfredo, that strains their relationship.', 'Y', 'N', 8.3),
	('Elementary', 'The Best Way Out Is Always Through', 3, 22, 'Yes', 'Yes', 'No', 30, 4, 2015, 'When a judge is murdered, Holmes and Watson become involved in the interstate search to find the prime suspect, an escaped convict from a privatized prison. Also, when Holmes applies his deductive reasoning to Detective Bells new relationship, the romance hits a rough patch.', 'Y', 'N', 8),
	('Elementary', 'Absconded', 3, 23, 'Yes', 'Yes', 'No', 7, 5, 2015, 'Holmes and Watson look into the death of a member of Holmes online beekeeping community who was a researcher looking into a deadly Northeast honey bee outbreak. During the investigation, they meet Tara Parker, a brilliant entomologist, academic and the leader of New Yorks beekeeping society. Also, Captain Gregson enlists Watsons services in an off-book investigation that helps him make a life-changing decision.', 'Y', 'N', 8.1),
	('Elementary', 'A Controlled Descent', 3, 24, 'Yes', 'Yes', 'No', 14, 5, 2015, 'Holmes and Watson take on an investigation of a personal nature when Holmes recovery sponsor, Alfredo, suddenly disappears. As they delve into Alfredos life for clues, Holmes questions whether their friend has been abducted, or worse, if he suffered a relapse into addiction.', 'Y', 'N', 8.5),
	('Elementary', 'The Past Is Parent', 4, 1, 'Yes', 'Yes', 'No', 5, 11, 2015, 'When Holmes faces criminal charges in the aftermath of his recent violent behavior and relapse, his powerful father arrives in New York to fix his estranged son\'s legal difficulties by any means necessary. Also, with Holmes and Watson\'s consultancy with the NYPD in jeopardy, Holmes concentrates on the case of a missing wife believed to have been killed by her husband to try and get back in the department\'s good graces.', 'N', 'N', 8.4),
	('Elementary', 'Evidence Of Things Not Seen', 4, 2, 'Yes', 'Yes', 'No', 12, 11, 2015, 'When Morland offers to use his influence to have Sherlock and Joan reinstated as consultants to the NYPD, Sherlock\'s mistrust of his father makes him question his motivation to help. Also, with no work offers coming in, Watson wrangles a gig with the FBI investigating a triple homicide in a top secret research lab.', 'N', 'N', 8.2),
	('Elementary', 'Tag, You\'re Me', 4, 3, 'Yes', 'Yes', 'No', 19, 11, 2015, 'When Sherlock finds himself distracted by his father\'s ongoing presence in New York City, he offers to help Morland resolve a work issue in exchange for his prompt departure home. Also, Holmes and Watson\'s investigation into the double murder of two men who looked alike leads them into the world of facial recognition technology.', 'N', 'N', 8.3),
	('Elementary', 'All My Exes Live In Essex', 4, 4, 'Yes', 'Yes', 'No', 26, 11, 2015, 'When Holmes and Watson investigate the murder of a fertility lab technician, they discover the woman had a secret personal life that leads them to multiple suspects. Also, the tables are turned on Watson when she\'s investigated by an NYPD detective.', 'N', 'N', 8.4),
	('Elementary', 'The Games Underfoot', 4, 5, 'Yes', 'Yes', 'No', 10, 12, 2015, 'When an archeologist is murdered, Holmes and Watson believe the man may have been killed for what he discovered during his last excavation in a local landfill. Also, Sherlock\'s relationship with Alfredo, his friend and former sobriety sponsor, hits a rough patch.', 'N', 'N', 8.2),
	('Elementary', 'The Cost Of Doing Business', 4, 6, 'Yes', 'Yes', 'No', 17, 12, 2015, 'Morland offers to act as one of his son\'s \'Irregular\' consultants so that he can lend Sherlock and Joan his considerable resources to help them solve a case.', 'N', 'N', 8.4),
	('Elementary', 'Miss Taken', 4, 7, 'Yes', 'Yes', 'No', 7, 1, 2016, 'When Watson\'s stepfather writes a crime novel based on her work with Holmes without her knowledge, an underlying issue in their relationship is revealed.  Also, as Holmes and Watson investigate a retired FBI agent\'s murder, they discover the man\'s death is connected to an unsolved case from the victim\'s career.', 'N', 'N', 9.2),
	('Elementary', 'A Burden Of Blood', 4, 8, 'Yes', 'Yes', 'No', 14, 1, 2016, 'Holmes and Watson investigate a homicide in which the victim was murdered in a manner reminiscent of the crimes of an infamous, and already incarcerated, serial killer. Also, Sherlock and Joan tutor Detective Bell for a police sergeant\'s exam that would lead to a promotion and a post at another precinct.', 'N', 'N', 8.3),
	('Elementary', 'Murder Ex Machina', 4, 9, 'Yes', 'Yes', 'No', 21, 1, 2016, 'Holmes and Watson search for a computer hacker responsible for three murders, including the death of a Russian billionaire who was visiting New York City. Also, Joan is surprised to receive a solo dinner invitation from Sherlock\'s father.', 'N', 'N', 8.3),
	('Elementary', 'Alma Matters', 4, 10, 'Yes', 'Yes', 'No', 28, 1, 2016, 'Holmes\' tentative reconciliation with his father suffers a setback when Holmes and Watson discover Morland has been keeping a secret that threatens all of their safety. Also, Holmes and Watson investigate two murders connected to a for-profit college and its illegal recruitment practices.', 'N', 'N', 8.3),
	('Elementary', 'Down Where The Dead Delight', 4, 11, 'Yes', 'Yes', 'No', 4, 2, 2016, 'Holmes and Watson must search for a killer without any physical evidence to aid them after a bomb is detonated in the New York City morgue. Also, Watson is suspicious when an NYPD detective she\'s in a grudge match with asks her to consult on a case.', 'N', 'N', 7.9),
	('Elementary', 'A View With A Room', 4, 12, 'Yes', 'Yes', 'No', 11, 2, 2016, 'Captain Gregson\'s colleague from Narcotics asks Holmes to orchestrate the perfect heist inside the heavily armed and virtually impenetrable compound of a drug-dealing biker gang. Also, when Watson assists Fiona Helbron, who helped her on a recent case, she makes a surprising discovery about Holmes.', 'N', 'N', 8.7),
	('Elementary', 'A Study In Charlotte', 4, 13, 'Yes', 'Yes', 'No', 18, 2, 2016, 'Sherlock and Joan search for a murderer who used poisonous mushrooms to kill a botany professor and a group of the instructor\'s students. Also, when Joan is disturbed by loud noise next door, she discovers her neighbor, Trent, is renting out his home through a vacation site that caters to hard partiers.', 'N', 'N', 8.3),
	('Elementary', 'Who Is That Masked Man', 4, 14, 'Yes', 'Yes', 'No', 25, 2, 2016, 'When Holmes\' investigation into the attempt on Morland\'s life pushes their strained relationship to the breaking point, the identity of Sherlock\'s mother is revealed. Also, when three gang members are murdered, Holmes and Watson are amazed when an elderly woman emerges as their prime suspect.', 'N', 'N', 8.1),
	('Elementary', 'Up To Heaven And Down To Hell', 4, 15, 'Yes', 'Yes', 'No', 3, 3, 2016, 'When Watson runs into Captain Gregson and his secret girlfriend, a former NYPD officer, she inadvertently sets the couple\'s breakup in motion. Also, Holmes and Watson investigate the murder of a wealthy woman who left her considerable estate solely to a beloved dog.', 'N', 'N', 8.2),
	('Elementary', 'Hounded', 4, 16, 'Yes', 'Yes', 'No', 10, 3, 2016, 'At the urging of Morland\'s wealthy associate, Henry Baskerville, Holmes and Watson look into the death of his brother and discover that a witness saw the man chased to his death by a large, glowing animal too fantastic to be real. Sherlock considers intervening when the trauma from the bombing at the morgue negatively impacts ME Hawes\' work.', 'N', 'N', 8.2),
	('Elementary', 'You\'ve Got Me, Who\'s Got You', 4, 17, 'Yes', 'Yes', 'No', 20, 3, 2016, 'When a vigilante dressed up as a comic book hero is murdered, Holmes and Watson need to find the man\'s true identity and find his killer. Also, Morland makes a surprise donation to Watson\'s favorite charity, in order to compel her to do him a business-related favor.', 'N', 'N', 8.1),
	('Elementary', 'Ready Or Not', 4, 18, 'Yes', 'Yes', 'No', 27, 3, 2016, 'When a survivalist doctor goes missing, Holmes and Watson must determine whether he\'s purposely gone off the grid or if he\'s a victim of foul play. Also, Holmes exhibits odd behavior when his romantic relationship with Fiona hits a critical point.', 'N', 'N', 8.1),
	('Elementary', 'All In', 4, 19, 'Yes', 'Yes', 'No', 10, 4, 2016, 'A mysterious woman who organizes illegal, high-stakes poker games arrives on Holmes and Watson\'s doorstep and tells them her life is in danger claiming to be a former associate of Mycroft, Sherlock\'s brother. However, as the pair investigates, Joan becomes suspicious that their new client isn\'t being truthful.', 'N', 'N', 8),
	('Elementary', 'Art Imitates Art', 4, 20, 'Yes', 'Yes', 'No', 10, 4, 2016, 'As Holmes and Watson investigate a woman\'s murder, they discover her death is linked to a piece of artwork that has ties to a crime that was committed when she was in college. Also, in the wake of a shocking personal revelation, Watson attempts to forge a connection with a recent client.', 'N', 'N', 7.4),
	('Elementary', 'Ain\'t Nothing Like The Real Thing', 4, 21, 'Yes', 'Yes', 'No', 17, 4, 2016, 'When Holmes and Watson are pulled into a double-homicide investigation, they discover the victims were staging a fake murder right at the moment they were killed. Also, Watson\'s inside man at Morland\'s office encounters a problem that threatens to expose her spying to Holmes and his father.', 'N', 'N', 8.3),
	('Elementary', 'Turn It Upside Down', 4, 22, 'Yes', 'Yes', 'No', 24, 4, 2016, 'Sherlock\'s father, Morland, becomes Sherlock and Joan\'s prime suspect in a murder investigation after one of his employees is killed under the guise of a robbery.', 'N', 'N', 8),
	('Elementary', 'The Invisible Hand', 4, 23, 'Yes', 'Yes', 'No', 1, 5, 2016, 'When Holmes and Watson discover the perpetrator behind the attempt made on Morland\'s life, they find a shocking connection to themselves.', 'N', 'N', 8.7),
	('Elementary', 'A Difference In Kind', 4, 24, 'Yes', 'Yes', 'No', 8, 5, 2016, 'Holmes and Watson\'s lives are threatened by an influential, worldwide criminal network connected to the murder attempt on Morland Holmes. Also, Sherlock\'s grievances with his father threaten their alliance to bring their mutual adversary to justice.', 'N', 'N', 8.5),
	('Elementary', 'Folie A Deux', 5, 1, 'No', 'No', 'No', 2, 10, 2016, 'When a serial bomber becomes active again after being dormant for six years, Watson seeks help from Shinwell Johnson, a former patient whose life she saved when she was a surgeon. Holmes senses Watson is unhappy and questions whether she is still fulfilled by her detective career.', 'N', 'N', 8),
	('Elementary', 'Worth Several Cities', 5, 2, 'No', 'No', 'No', 16, 10, 2016, 'When the leader of a local street gang abducts Holmes to compel him to find the person responsible for a hit on his men, Holmes and Watson get caught in the middle of an international hunt to recover a centuries old, priceless artifact. Watson debates whether a personal favor Shinwell asks of her is outside her comfort zone.', 'N', 'N', 8.1),
	('Elementary', 'Render, And Then Seize Her', 5, 3, 'No', 'No', 'No', 23, 10, 2016, 'Holmes learns a secret about Captain Gregsons girlfriend when she hires him for a case she wants kept off of Gregsons radar. Holmes and Watson join the NYPDs search for an abducted woman.', 'N', 'N', 8),
	('Elementary', 'Henny Penny The Sky Ss Falling', 5, 4, 'No', 'No', 'No', 30, 10, 2016, 'Captain Gregson lobbies to include Holmes and Watson when his unit is selected to receive a city commendation for its exemplary work. As Holmes and Watson consult on the investigation into a financial analysts murder, they are drawn into the world of asteroid research.', 'N', 'N', 8),
	('Elementary', 'To Catch A Predator Predator', 5, 5, 'No', 'No', 'No', 6, 11, 2016, 'Holmes and Watson have plenty of suspects when they investigate the murder of a man who led a secret life as a vigilante, catfishing sexual predators on dating sites and publicly shaming them. When Shinwells criminal record prevents him from finding a full-time job, Holmes disagrees with Watsons plan to help him.', 'N', 'N', 8),
	('Elementary', 'Ill Tidings', 5, 6, 'No', 'No', 'No', 13, 11, 2016, 'Holmes and Watson investigate a mass murder when a chef and his patrons are poisoned with snake venom. Detective Bells crush on a work colleague makes Holmes realize his and Fionas relationship is at an important crossroads.', 'N', 'N', 8.2),
	('Elementary', 'Bang Bang Shoot Chute', 5, 7, 'No', 'No', 'No', 20, 11, 2016, 'Holmes and Watson search for two murderers after a base jumper is shot out of the sky by one killer, and has his parachute sabotaged by another. After Joans sister, Lin, thinks she sees Shinwell with a member of his old gang, Joan takes drastic measures to make sure he wont be drawn back into a life of crime.', 'N', 'N', 7.9),
	('Elementary', 'How The Sausage Is Made', 5, 8, 'No', 'No', 'No', 27, 11, 2016, 'Joan worries Sherlocks sobriety is at risk when she learns he has been lying to her about attending recovery meetings. Sherlock and Joan discover a mans death caused by ingesting poisoned sausage is connected to a lab working on a breakthrough in the artificial meat industry.', 'N', 'N', 8.1),
	('Elementary', 'It Serves You Right To Suffer', 5, 9, 'No', 'No', 'No', 11, 12, 2016, 'When Shinwell comes to Holmes and Watson for help after hes framed for a gang killing, they have three days to find the real murderer before he is arrested and sent back to jail.', 'N', 'N', 8.3),
	('Elementary', 'Pick Your Poison', 5, 10, 'No', 'No', 'No', 18, 12, 2016, 'When Watson is implicated in a DEA investigation into doctors writing illegal prescriptions, she and Holmes search for the person using her medical license to sell drugs.', 'N', 'N', 8.1),
	('Elementary', 'Be My Guest', 5, 11, 'No', 'No', 'No', 8, 1, 2017, 'Holmes and Watson race to find a woman whos been held captive for years before the kidnapper takes drastic steps to avoid being caught. Watson becomes frustrated when Shinwell refuses to focus on his informant training with her and Holmes.', 'N', 'N', 8.3),
	('Elementary', 'Crowned Clown, Downtown Brown', 5, 12, 'No', 'No', 'No', 15, 1, 2017, 'When Holmes and Watson investigate a clowns murder upstate, they discover a connection between his death and the creation of a new weaponized virus. Watson helps Bell when hes targeted by his new love interest Chantals ex-husband in attempt to sabotage her career at the district attorneys office.', 'N', 'N', 8.1),
	('Elementary', 'Over A Barrel', 5, 13, 'No', 'No', 'No', 29, 1, 2017, 'A man takes hostages, including Joan, and threatens to execute them unless Holmes finds the person responsible for the death of his son. As Sherlock investigates, the captor gives him 16 hours to find the perpetrator before the statute of limitations on the crime runs out.', 'N', 'N', 8.2),
	('Elementary', 'Rekt In Real Life', 5, 14, 'No', 'No', 'No', 19, 2, 2017, 'Holmes and Watson investigate the murder of a former professional eSports video game player during a live video stream. Shinwell approaches Joan for advice when his teenage daughter asks to meet with him for the first time in years.', 'N', 'N', 7.1),
	('Elementary', 'Wrong Side Of The Road', 5, 15, 'No', 'No', 'No', 5, 3, 2017, 'Holmes\' former protg, Kitty Winter, returns to New York after a three-year absence to warn him that a killer is eliminating everybody involved with a case they worked on together in London.  Watson discovers that Kitty has a life-changing secret.', 'N', 'N', 8.4),
	('Elementary', 'Fidelity', 5, 16, 'No', 'No', 'No', 12, 3, 2017, 'In the conclusion, Joan and Kitty try to prove that a string of murders, stemming from an old case Sherlock and Kitty solved in London, is connected to an international government conspiracy with the Defense Intelligence Agency at its center. Sherlock and Kittys relationship is strained after she shares life-changing news.', 'N', 'N', 8.1),
	('Elementary', 'The Ballad Of Lady Frances', 5, 17, 'No', 'No', 'No', 19, 3, 2017, 'The police call in Holmes and Watson to consult on a homicide \'heard\' by a cutting edge gunshot detection system. Sherlock and Joan become suspicious of Shinwell when he\'s the target of a drive-by shooting that reveals a connection between him and an unsolved murder.', 'N', 'N', 8),
	('Elementary', 'Dead Man\'s Tale', 5, 18, 'No', 'No', 'No', 26, 3, 2017, 'Sherlock and Joan question how well they know Shinwell when they investigate the possibility he may have gotten away with the unsolved murder of his friend, a fellow gang member. Sherlock and Joans latest case puts them on the hunt for a treasure map rumored to lead to a fortune in pirates gold hidden around New York City.', 'N', 'N', 8),
	('Elementary', 'High Heat', 5, 19, 'No', 'No', 'No', 9, 4, 2017, 'Holmes and Watson investigate the murder of a man Sherlock considered one of New Yorks worst private investigators. Also, as Holmes stews over being beaten by Shinwell, he decides to take out his aggression by dismantling a local organization of private investigators.', 'N', 'N', 7.5),
	('Elementary', 'The Art Of Sleights And Deception', 5, 20, 'No', 'No', 'No', 23, 4, 2017, 'Holmes and Watson get mixed up in murder and magic when they investigate the death of a magician killed while performing a classic stunt. Also, Watson suspects Bell is being targeted by the ex-husband of his girlfriend, Chantal, after a false allegation lands him the middle of an Internal Affairs investigation.', 'N', 'N', 7.1),
	('Elementary', 'Fly Into A Rage, Make A Bad Landing', 5, 21, 'No', 'No', 'No', 30, 4, 2017, 'When Detective Bells girlfriend, Chantal, is assaulted and her ex-husband is killed soon after, in what Holmes and Watson discover is a staged suicide, they search for one suspect behind the linked crimes. Also, as Bell fights the urge to seek his own brand of justice for Chantal, Sherlock makes a heartbreaking realization about the detectives past.', 'N', 'N', 7.9),
	('Elementary', 'Moving Targets', 5, 22, 'No', 'No', 'No', 7, 5, 2017, 'When a reality show contestant is murdered, Holmes and Watson zero in on another competitor as a suspect, a former war criminal who may be the most skilled killer theyve ever pursued. Also, for the first time since he attacked Sherlock, Shinwell reaches out to Joan to ask for a favor.', 'N', 'N', 7),
	('Elementary', 'Scrambled', 5, 23, 'No', 'No', 'No', 14, 5, 2017, 'Holmes and Watson investigate a murder that puts them in the crosshairs of one of New York Citys deadliest gangs. Also, Holmes behavior becomes increasingly erratic when he secretly interacts with a mysterious woman.', 'N', 'N', 7.7),
	('Elementary', 'Hurt Me, Hurt You', 5, 24, 'No', 'No', 'No', 21, 5, 2017, 'Holmes and Watson pursue an elusive criminal as a gang war erupts in New York City. While the NYPD works to contain the violence, the two investigate the murder that appears to have ignited the city-wide conflict, and discover that a familiar face is pulling the strings.', 'N', 'N', 6),
	('Firefly', 'Serenity', 1, 1, 'Yes', 'Yes', 'Yes', 20, 12, 2002, 'After a flashback to Zoe\'s and Mal\'s days in the wars six years previous, we cut to the modern day where the Serenity crew is running a salvage operation on a deserted ship and are forced to flee with the cargo when the Alliance show up. Their buddy Badger refuses to buy the cargo so they head off to the rim worlds after picking up three passengers: Book, Simon, and Dobson. En route someone sends a signal to the Alliance and it turns out to be Dobson, an undercover Federal agent, who arrests Simon but is glad to take the whole crew in. He shoots Kaylee before being captured, and Simon forces Mal to flee in return for his doctoring services. When Mal investigates Simon\'s cargo he finds a naked woman...', 'Y', 'N', 8.6),
	('Firefly', 'The Train Job', 1, 2, 'Yes', 'Yes', 'Yes', 20, 9, 2002, 'Serenity continues to travel through space conducting illegal runs across the star system, which is under the control of The Alliance. A powerful and fearsome mobster named Adelei Niska demands that the crew of Serenity pull a train robbery. The train is carrying medical supplies for a community, and Reynolds and Zoe get held on suspicion. They get free with Inara\'s help but realize they were tricked and try to return Niska\'s money. His henchman isn\'t too happy, but Mal \'persuades\' the next guy to take the money back. Meanwhile, two blue-handed, black-suited operatives close in on River.', 'Y', 'N', 8.7),
	('Firefly', 'Bushwacked', 1, 3, 'Yes', 'Yes', 'Yes', 27, 9, 2002, 'On a salvage mission aboard a drifting colony ship, the Serenity crew find signs that the crew were killed by the cannibalistic Reavers. They find one survivor, but things take a turn for the worse when an Alliance ship looking for an unspecified Firefly-class ship with brother-and-sister stowaways shows up and takes them in.', 'Y', 'N', 9.2),
	('Firefly', 'Shindig', 1, 4, 'Yes', 'Yes', 'Yes', 1, 11, 2002, 'On the planet Persephone the crew contact their old \'friend\' Badger the ruthless crime lord to transport some goods on behalf of a local lord. While at a ball to arrange a transport job with the lord, Mal defends Inara\'s honor when her current customer insults her. By local custom he unintentionally challenges her date, Atherton Wing, to a duel.', 'Y', 'N', 9),
	('Firefly', 'Safe', 1, 5, 'Yes', 'Yes', 'Yes', 8, 11, 2002, 'On a planet, Simon is kidnapped by locals who need a doctor, while River is threatened with burning as a witch.', 'Y', 'N', 9.5),
	('Firefly', 'Our Mrs Reynolds', 1, 6, 'Yes', 'Yes', 'Yes', 4, 10, 2002, 'While completing a job on a backwater world, Mal is married to a village girl without his knowledge. The girl, Saffron, gets onboard and the crew does not find her until they\'re already in the air. Mal is not sure what to do with her, but let her come along.', 'Y', 'N', 8.6),
	('Firefly', 'Jaynestown', 1, 7, 'Yes', 'Yes', 'Yes', 18, 10, 2002, 'Serenity sets down at the mudder colony of Canton where it turns out Jayne is a hero for having dropped a bunch of money there years ago that he and his partner Stitch stole from the local magistrate. The drop was unintentional but Jayne doesn\'t turn down the attentions. Meanwhile, Kaylee and Simon dance, River rewrites Book\'s bible, and Inara beds the magistrate\'s son, a virgin.', 'Y', 'N', 8.3),
	('Firefly', 'Out Of Gas', 1, 8, 'Yes', 'Yes', 'Yes', 25, 10, 2002, 'In a delirious state after Serenity\'s engine explodes, draining the ship of its oxygen supply, Mal has a series of flashbacks about how he came to own Serenity and form his crew. ', 'Y', 'N', 9.2),
	('Firefly', 'Ariel', 1, 9, 'Yes', 'Yes', 'Yes', 15, 11, 2002, 'The crew visit the planet Ariel because Inara needs to receive an annual Companion physical. The crew is offered a surprising job by Simon: in return for stolen medicine he wants them to get him into a hospital to use a high-end scanner to diagnose River. Simon devises a plan - Kaylee and Wash browse through the local dump and find parts to make an imitation emergency vehicle so the crew can get into the hospital posing as EMTs. Simon and River pose as corpses with the aid of a drug Simon has. While Mal and Zoe round up some medicine, Jayne stays with River and Simon, who are unaware he has ratted them out to the Alliance in return for money.', 'Y', 'N', 9.1),
	('Firefly', 'War Stories', 1, 10, 'Yes', 'Yes', 'Yes', 6, 12, 2002, 'Jealous of Zoe\'s relationship with Mal, Wash insists (thanks to a bit of scheming) that he go with Mal to try to sell some of the medical supplies the crew stole from the Alliance.  In the middle of the deal Mal and Wash are kidnapped by men working for Niska the crime lord, who wants revenge against Mal for the botched train heist.  He tortures Mal and Wash until Zoe shows up offering money in exchange for the prisoners.  Niska says that the money is only enough for one person and Zoe chooses Wash. Wash realizes that Mal\'s antagonizing him while they were being tortured was to help keep him alive and kicking.  This inspires him to do everything he can to help Zoe rescue Mal from Niska.  The rest of the crew jump on board to save the Captain. Meanwhile Inara extends her services to a council member.  To the crew of Serenity\'s surprise, it\'s a woman. And Simon continues to treat River with some of the medicine he stole but she suffers the occasional relapse as well as displays a penchan', 'Y', 'N', 9.4),
	('Firefly', 'Trash', 1, 11, 'Yes', 'Yes', 'Yes', 21, 7, 2003, 'Saffron returns - after Mal breaks up her current gig, she convinces him and the crew to help out with a \'perfect crime\' that isn\'t. The crime: go to Bellerophon and steal a criminal\'s prototype laser gun from his collection. The plan: Saffron and Mal sneak in and dump the gun down the trash, bypassing security, and the Serenity crew grab it from the disposal system. Of course, this is Saffron, and it turns out she\'s married to the crook, Durran, and plans to double-cross Mal. Things don\'t work out so well and Saffron strands Mal naked in the desert. Fortunately Mal and Inara anticipated a betrayal and set it up so Inara grabs the gun, leaves Saffron behind, and rescues Mal. Meanwhile, Simon figures out Jayne betrayed them and the two have words.', 'Y', 'N', 9.1),
	('Firefly', 'The Message', 1, 12, 'Yes', 'Yes', 'Yes', 28, 7, 2003, 'An old war comrade of Mal\'s and Zoe\'s, Tracey, mails his corpse to them. He also leaves a message asking them to deliver his body to his family. Some men claiming to be with the Alliance is on the trail of the body and catch up to them demanding the body. The crew can\'t find anything on Tracey\'s corpse, but as they prepare to cut it open, Tracey comes back to life. He explains he is smuggling super-organs in his own body. They flee to the planet with the men in hot pursuit and eventually/supposedly agree to give up Tracey. Tracey gets wind of the plan and makes a break for it with Kaylee as a hostage, they shoot him down and Mal reveals they were going to send the officer off since he\'s out of his jurisdiction and on a personal mission with no authority. Then Tracey dies and they deliver his body for real this time.', 'Y', 'N', 8.5),
	('Firefly', 'Heart Of Gold', 1, 13, 'Yes', 'Yes', 'Yes', 23, 6, 2003, 'The crew of the Serenity are in for a gunfight when one of Inara\'s companion colleagues asks for their help. The Serenity crew defends a bordello from a gunslinger who got a prostitute. Mal falls for the bordello\'s madam. pregnant and now intends to collect the child', 'Y', 'N', 9),
	('Firefly', 'Objects In Space', 1, 14, 'Yes', 'Yes', 'Yes', 13, 12, 2002, 'A bounty hunter boards the Serenity to capture River for the Alliance.', 'Y', 'N', 8.6),
	('Friends', 'The Pilot', 1, 1, 'Yes', 'Yes', 'No', 22, 9, 1994, 'This is the one where it all began ... Rachel leaves Barry at the altar, meets the gang, and moves in with Monica. Monica, meanwhile, sleeps with Paul the Wine Guy, and Ross is reeling from his divorce from Carol, who has become a lesbian.', 'Y', 'N', 8.6),
	('Friends', 'The One With The Sonogram At The End', 1, 2, 'Yes', 'Yes', 'No', 29, 9, 1994, 'Carol, Ross\'s lesbian ex-wife, tells him at work that she is pregnant with his child, Monica nearly has a breakdown when her parents come for dinner, and Rachel finds out that Barry and her maid of honor Mindy, went on her honeymoon.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Thumb', 1, 3, 'Yes', 'Yes', 'No', 6, 10, 1994, 'Chandler\'s reunited with his beloved cigarettes, which the rest of his friends can\'t stand. Monica dates a man all her buddies love but with whom she\'s bored. And poor, honest Phoebe can\'t deal with the fact that her bank gave her one thousand dollars that isn\'t hers, plus a soda company gives her seven thousand more unwanted bucks after she finds a dismembered thumb in a can of soda.', 'Y', 'N', 8.3),
	('Friends', 'The One With George Stephanopoulos', 1, 4, 'Yes', 'Yes', 'No', 13, 10, 1994, 'This is the one where Ross mourns the anniversary of losing his virginity to Carol while at a hockey game with the guys. Rachel gets her first paycheck, the girls have a slumber party, and George Stephanopoulos\'s pizza is delivered to Monica by mistake.', 'Y', 'N', 8.3),
	('Friends', 'The One With The East German Laundry Detergent', 1, 5, 'Yes', 'Yes', 'No', 20, 10, 1994, 'Joey wants to get back together with a former girlfriend he dumped, so he tricks Monica into posing as his new gal pal. Ross helps Rachel, a laundry virgin, do her first load of wash. And Chandler has a difficult time breaking up with his annoying girlfriend, Janice.', 'Y', 'N', 8.6),
	('Friends', 'The One With The Butt', 1, 6, 'Yes', 'Yes', 'No', 27, 10, 1994, 'Joey gets his big film break when he\'s hired to be Al Pacino\'s stunt butt. Chandler has second thoughts about an exotic married woman who wants him to be her sex toy. And Monica tries hard to prove to her friends that she really doesn\'t have a type-A personality and can be as kooky as the next anal-retentive chef.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Blackout', 1, 7, 'Yes', 'Yes', 'No', 3, 11, 1994, 'Just as Phoebe\'s about to sing miserable folk songs at Central Perk, New York has a blackout. The gang returns to Monica and Rachel\'s apartment, where Ross is about to tell Rachel he likes her. Meanwhile, Chandler is stuck in an ATM vestibule with Victoria\'s Secret model Jill Goodacre, whom he desperately tries to impress.', 'Y', 'N', 9),
	('Friends', 'The One Where Nana Dies Twice', 1, 8, 'Yes', 'Yes', 'No', 10, 11, 1994, 'Monica and Ross mourn the death of their grandmother Nana, and Monica and Mrs. Gellar come to an unspoken understanding about the relationship between mothers and daughters. Meanwhile, Chandler is irritated by office speculation that he\'s gay.', 'Y', 'N', 8.2),
	('Friends', 'The One Where Underdog Gets Away', 1, 9, 'Yes', 'Yes', 'No', 17, 11, 1994, 'Monica\'s first Thanksgiving dinner for the gang burns when they all run to the rooftop to see the runaway Underdog balloon from the parade. Joey wins his first modeling gig as the poster boy for VD. And Ross competes with Susan to \'communicate\' with his unborn baby.', 'Y', 'N', 8.4),
	('Friends', 'The One With The Monkey', 1, 10, 'Yes', 'Yes', 'No', 15, 12, 1994, 'The gang makes and breaks a pact to celebrate New Year\'s Eve without dates. Ross compensates for his loneliness by getting a roommate - a monkey named Marcel whom everyone adores. Well, everyone except Monica, who can\'t get past the faeces-throwing thing. And Phoebe faces a difficult decision when she meets a shy physicist who\'s thinking about giving up a fellowship in Minsk to stay with her.', 'Y', 'N', 8.1),
	('Friends', 'The One With Mrs. Bing', 1, 11, 'Yes', 'Yes', 'No', 5, 1, 1995, 'Chandler\'s romance novelist mum comes to New York to visit him and he\'s not sure how he feels about it, especially after Joey catches Mrs. Bing and Ross kissing. Meanwhile, Monica and Phoebe compete for the \'attention\' of Coma Guy, who gets hit by an ambulance after Monica woo-woo\'s at him on the street.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Dozen Lasagnas', 1, 12, 'Yes', 'Yes', 'No', 12, 1, 1995, 'Everyone knows the sex of Ross\'s baby (it\'s a boy), except for Ross, who doesn\'t want to find out until it\'s born. Rachel\'s relationship with Paulo ends after he makes a pass at Phoebe. And though Monica hates him, she sends him off with one of the dozen lasagnas she made for her aunt, who doesn\'t want them anymore because they\'ve got meat in them. Meanwhile, Chandler and Joey go shopping for a new kitchen table and come home with a Foosball table instead.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Boobies', 1, 13, 'Yes', 'Yes', 'No', 19, 1, 1995, 'After Chandler accidentally sees Rachel wandering around topless after her shower, a chain reaction of nudity ensues when she tries to even the score by seeing his penis. Joey finds himself playing parent when he has to decide whether to hide his father\'s affair from his mom. And no one can stand Phoebe\'s new boyfriend, an irritating guy named Roger.', 'Y', 'N', 8.7),
	('Friends', 'The One With The Candy Hearts', 1, 14, 'Yes', 'Yes', 'No', 9, 2, 1995, 'Ross\'s first date in nine years is on Valentine\'s Day with a beautiful neighbor. Susan and Carol, also out on a romantic date; end up at the same restaurant. Joey sets Chandler up on a blind date - with Janice. And Phoebe, Rachel and Monica decide to spend the holiday building a boyfriend bonfire in their apartment.', 'Y', 'N', 8.4),
	('Friends', 'The One With The Stoned Guy', 1, 15, 'Yes', 'Yes', 'No', 16, 2, 1995, 'Monica cooks a gourmet meal for a restaurateur looking for a new chef. Unfortunately, he\'s stoned and would just as well eat taco shells as her haute cuisine. After working as a data processing permanent temp for five years, Chandler gets promoted to data processing supervisor, then quits. And Ross has a date with a beautiful colleague named Celia and gives new meaning to the term \'spanking the monkey\' when he brings her back to his place to meet Marcel. Celia wants to meet his pee-pee, but only if he\'ll talk dirty to her.', 'Y', 'N', 8.4),
	('Friends', 'The One With Two Parts - 1', 1, 16, 'Yes', 'Yes', 'No', 23, 2, 1995, 'Joey falls for Phoebe\'s twin sister, Ursula, making Phoebe feel neglected. Meanwhile, Chandler finds himself between a rock and a hard place, when he is told to fire an employee he is attracted to. And Ross has doubts about parenthood when he attends Lamaze classes with Carol and Susan.', 'Y', 'N', 8.3),
	('Friends', 'The One With Two Parts - 2', 1, 17, 'Yes', 'Yes', 'No', 23, 2, 1995, 'After weeks of procrastinating, Rachel finally takes down the Christmas light on their balcony, only to fall off the balcony and sprain her ankle. At the hospital, Rachel - who has no insurance - cajoles Monica into trading identities so she can use Monica\'s coverage. When Ursula breaks Joey\'s heart Phoebe tries to fix it.', 'Y', 'N', 8.6),
	('Friends', 'The One With All The Poker', 1, 18, 'Yes', 'Yes', 'No', 2, 3, 1995, 'Tired of being referred to by customers as \'Excuse me\' Rachel interviews for a job as an assistant buyer at Saks Fifth Avenue. She also sees another side of the usually docile Ross when the girls face the boys during a not-so-friendly game of poker.', 'Y', 'N', 8.9),
	('Friends', 'The One Where The Monkey Gets Away', 1, 19, 'Yes', 'Yes', 'No', 9, 3, 1995, 'The gang searches frantically for Marcel, who slipped out of the apartment while Rachel was baby-sitting him. After Marcel is found and safe, Ross finally gets up the courage to try to woo Rachel. But just when it looks like the two might actually spend a romantic evening alone together, Barry, the ex-Mr. Potato Head, barges into the apartment declaring his love for her.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Evil Orthodontist', 1, 20, 'Yes', 'Yes', 'No', 6, 4, 1995, 'Rachel and Barry start dating again, which is kind of awkward because he\'s now engaged to Mindy, who wants Rachel to be her maid of honor. But when Rachel finds out that Mindy and Barry had an affair while she was engaged to Barry, the two women decide to give Barry what for. Meanwhile, Chandler goes nuts when a woman he likes won\'t return his phone calls.', 'Y', 'N', 8),
	('Friends', 'The One With The Fake Monica', 1, 21, 'Yes', 'Yes', 'No', 27, 4, 1995, 'When Monica\'s credit card is stolen, she, along with Phoebe and Rachel, decide to catch the thief. Joey enlists his friends to help him come up with a less ethnic-sounding stage name. And when Ross finds out that Marcel has reached sexual maturity and needs to be with other monkeys, he tries to get him accepted into the Harvard of zoos.', 'Y', 'N', 8),
	('Friends', 'The One With The Ick Factor', 1, 22, 'Yes', 'Yes', 'No', 4, 5, 1995, 'After losing his virginity to her, Monica\'s boyfriend Young Ethan reveals that he\'s a high school senior. Rachel has erotic dreams about Joey and Chandler, making Ross both disgusted and envious. And when Phoebe temps as Chandler\'s secretary, she finds out that no one at work likes him anymore.', 'Y', 'N', 8.4),
	('Friends', 'The One With The Birth', 1, 23, 'Yes', 'Yes', 'No', 11, 5, 1995, 'As Monica\'s biological clock ticks away like a time bomb, Carol goes into labor. When Ross and Susan can\'t stop bickering over who gets to help Carol more, Phoebe drags both of them into a closet to settle their differences - but all three end up getting locked in just as Carol\'s about to give birth to the baby. And Rachel flirts with an OB/GYN who has a love-hate relationship with women\'s private parts.', 'Y', 'N', 8.7),
	('Friends', 'The One Where Rachel Finds Out', 1, 24, 'Yes', 'Yes', 'No', 18, 5, 1995, 'Joey\'s new girlfriend wants to go to bed with him but he can\'t yet. He\'s participating in a fertility study. During Rachel\'s birthday party, Chandler accidentally lets it slip that Ross is in love with her. However, Ross is on his way to China to identify a bone for the museum. Monica is excited about becoming friends-in-law with her roommate but gets defensive when Rachel can\'t decide about whether she wants to be more than friends with Ross. But when she finally makes up her mind, it may be too late. Returning from China, with Rachel waiting at the gate, Ross is with another woman with whom he is obviously involved.', 'Y', 'N', 8.9),
	('Friends', 'The One With Ross\'s New Girlfriend', 2, 1, 'Yes', 'Yes', 'No', 21, 9, 1995, 'Rachel waits patiently at the airport for Ross, not knowing he is returning with a new girlfriend, Julie. Meanwhile, after giving Joey and Chandler new haircuts, Phoebe is persuaded to cut Monica\'s hair, but gives her an awful haircut. And Joey learns that his tailor is a very naughty man.', 'Y', 'N', 8.6),
	('Friends', 'The One With The Breast Milk', 2, 2, 'Yes', 'Yes', 'No', 28, 9, 1995, 'The guys are uncomfortable with Carol\'s breast milk and Rachel is uncomfortable with Monica\'s growing friendship with Julie. Meanwhile, Joey competes with a fellow cologne spritzer for the affections of a beautiful colleague.', 'Y', 'N', 8.3),
	('Friends', 'The One Where Heckles Dies', 2, 3, 'Yes', 'Yes', 'No', 5, 10, 1995, 'After Mr. Heckles dies and leaves all his belongings to Monica and Rachel, Chandler discovers eerie similarities between the late eccentric man and his own life. Ross and Phoebe have a dispute over the progression of evolution.', 'Y', 'N', 8.4),
	('Friends', 'The One With Phoebe\'s Husband', 2, 4, 'Yes', 'Yes', 'No', 12, 10, 1995, 'The gang is amazed to learn that Phoebe married a gay Canadian ice dancer to help him get his green card. And Ross seeks relationship advice from Rachel after revealing that he and Julie have yet to consummate their relationship.', 'Y', 'N', 8.1),
	('Friends', 'The One With Five Steaks And An Eggplant', 2, 5, 'Yes', 'Yes', 'No', 19, 10, 1995, 'When a sexy woman calls the wrong number, Chandler seeks to make the most of the situation. And income issues divide the friends: the well-off Ross, Chandler and Monica versus the not-so-well-off Phoebe, Rachel and Joey. This all changes, however, when Monica is accused of taking kickbacks and fired.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Baby On The Bus', 2, 6, 'Yes', 'Yes', 'No', 2, 11, 1995, 'Chandler and Joey baby-sit Ross\'s son Ben and accidentally lose him while scoping babes on a bus. Phoebe loses her Central Perk singing gig to a professional singer. And Ross has an allergic reaction to Monica\'s kiwi-lime pie.', 'Y', 'N', 8.7),
	('Friends', 'The One Where Ross Finds Out', 2, 7, 'Yes', 'Yes', 'No', 9, 11, 1995, 'A drunken Rachel is persuaded to call Ross and reveals her feelings for him on his answering machine. And when he finds out, he must make the choice between her and Julie. Meanwhile, Monica finds work as Chandler\'s personal trainer and Phoebe has a hard time trying to get her boyfriend to have sex with her.', 'Y', 'N', 9),
	('Friends', 'The One With The List', 2, 8, 'Yes', 'Yes', 'No', 16, 11, 1995, 'Ross must choose between Rachel and Julie and enlists Joey and Chandler\'s help in making a list of the pros and cons of each. Big mistake. Meanwhile, Monica gets a job making food with a synthetic chocolate substitute called Mockolate.', 'Y', 'N', 8.5),
	('Friends', 'The One With Phoebe\'s Dad', 2, 9, 'Yes', 'Yes', 'No', 14, 12, 1995, 'It\'s Christmas time and Monica tries tipping with cookies, rather than cash, with mixed results. Phoebe learns that the guy in the picture frames her grandmother keeps around is not her father and tries to track down her real father. And Chandler and Joey wait too late to shop for presents.', 'Y', 'N', 8),
	('Friends', 'The One With Russ', 2, 10, 'Yes', 'Yes', 'No', 4, 1, 1996, 'Monica gets back together with Fun Bobby, but discovers that when he\'s not drinking, he\'s not so fun. Joey wins the role of Dr. Drake Ramoray, a neurosurgeon, on Days of Our Lives. And Rachel, dating a guy named Russ, can\'t see his uncanny resemblance to Ross.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Lesbian Wedding', 2, 11, 'Yes', 'Yes', 'No', 18, 1, 1996, 'Ross\'s ex and her lesbian lover tie the knot, providing Monica with a job: catering the wedding. Phoebe is possessed by the spirit of an eighty-two year old massage client who dies in the middle of a session. Mrs. Adelman cannot depart until she\'s \'seen everything\' (needless to say, her spirit departs after the lesbian wedding). And Rachel\'s mom comes to visit and drops a bombshell: she\'s getting divorced from Rachel\'s dad.', 'Y', 'N', 8.2),
	('Friends', 'The One After The Superbowl - 1', 2, 12, 'Yes', 'Yes', 'No', 28, 1, 1996, 'Ross goes to visit Marcel while on a trip to California, and finds that the monkey is working in commercials. Joey gets his first fan letter and ends up dating the woman, who turns out to be a stalker who thinks that the happenings on Days of Our Lives are real. Phoebe is asked to sing for the children at the library, but their parents are horrified by her lyrics.', 'Y', 'N', 8.7),
	('Friends', 'The One After The Superbowl - 2', 2, 13, 'Yes', 'Yes', 'No', 28, 1, 1996, 'Rachel and Monica compete for the affections of Jean-Claude Van Damme after meeting him on a movie set. Chandler meets a former schoolmate, a makeup artist, who seems to have the hots for him. An excited Joey gets a role as an extra in the movie and Ross and Marcel go on a whirlwind tour of the city.', 'Y', 'N', 8.8),
	('Friends', 'The One With The Prom Video', 2, 14, 'Yes', 'Yes', 'No', 1, 2, 1996, 'After getting his big break, with Days of Our Lives, Joey pays Chandler back with $812 and an extremely tacky bracelet. Also, an unemployed Monica is hard up for money. And Monica and Rachel\'s prom video reveals Monica\'s former girth, Rachel\'s former nose and the way Ross has always felt about Rachel. This video brings Rachel to forgive Ross for the list.', 'Y', 'N', 9.4),
	('Friends', 'The One Where Ross And Rachel... You Know', 2, 15, 'Yes', 'Yes', 'No', 8, 2, 1996, 'Joey buys a big screen TV and two leather recliners with his newfound money. He and Chandler then spend a day refusing to leave the chairs. They even have food delivered to the girls apartment so they don\'t have to answer the door. Monica has a catering job for a friend of her parents, the attractive Dr. Burke. She ends up kissing him the next day at an un-needed eye exam and though there is a 21-year age difference between them, they begin dating. Ross and Rachel attempt to have their first real date, but Rachel laughs every time they kiss. When they try again the next evening, they are interrupted when Ross is called into the museum. It\'s too late to go to the restaurant so they have a picnic in the planetarium and end up waking up the next day naked in the display area with a group of Catholic school children looking in.', 'Y', 'N', 8.9),
	('Friends', 'The One Where Joey Moves Out', 2, 16, 'Yes', 'Yes', 'No', 15, 2, 1996, 'After having a fight with Chandler, Joey decides to move out. Rachel and Phoebe decide to get tattoos. And on his birthday, Mr. Geller receives the unsettling news that his best friend, Richard, and his daughter, Monica, are dating.', 'Y', 'N', 8.6),
	('Friends', 'The One Where Eddie Moves In', 2, 17, 'Yes', 'Yes', 'No', 22, 2, 1996, 'Phoebe is discovered by a record producer who wants to make \'Smelly Cat\' a video. Ross\'s new relationship with Rachel makes Monica feel like she\'s living with her brother again...and she hates it. And Joey considers moving back in with Chandler, but Chandler has a new roommate.', 'Y', 'N', 8.4),
	('Friends', 'The One Where Dr. Ramoray Dies', 2, 18, 'Yes', 'Yes', 'No', 21, 3, 1996, 'Joey finds out the hard way that it\'s not wise to boast false things: His soap opera character gets dropped down an elevator shaft. Phoebe helps Chandler bond with his new roommate...much to Chandler\'s horror. And sexual history dominates the discussion between two couples--Monica and Richard, and Ross and Rachel.', 'Y', 'N', 8.5),
	('Friends', 'The One Where Eddie Won\'t Go', 2, 19, 'Yes', 'Yes', 'No', 28, 3, 1996, 'Creeped out by his bizarre new roommate, Chandler demands he move out. Eddie agrees...but doesn\'t go. Joey has trouble coming to grips with the death of Dr. Drake Ramoray and the accompanying change in his lifestyle. And a new book on employment for women inspires the female friends to have a \'goddess meeting.\'', 'Y', 'N', 8.7),
	('Friends', 'The One Where Old Yeller Dies', 2, 20, 'Yes', 'Yes', 'No', 4, 4, 1996, 'Phoebe\'s world view is shattered when she learns how \'Old Yeller\' really ends. Monica becomes jealous when Richard begins going out with other people, namely Joey and Chandler. And Rachel becomes upset when she learns that Ross has planned their whole life together.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Bullies', 2, 21, 'Yes', 'Yes', 'No', 25, 4, 1996, 'Chandler and Ross run into two bullies at the coffee shop; one of whom steals Chandler\'s hat. After trying to avoid them, the guys confront the bullies and are ready to fight. When a thief steals their stuff, the bullies join Ross and Chandler in trying to get it back. Monica, down to her last few dollars of savings, plays the stock market based solely on the ticker symbols. After she loses it all she\'s forced to take a job at a 50s theme restaurant where she\'ll have to dance and wear \'flame retardant boobs.\' Phoebe makes multiple attempts to go visit her birth father and when she finally does, she finds out he\'s no longer there. She does meet her half-brother, though.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Two Parties', 2, 22, 'Yes', 'Yes', 'No', 2, 5, 1996, 'The gang plans a surprise party for Rachel, but the real surprise is when both of her estranged parents show up for the same party. \'Think!\' urges Chandler. \'What would Jack and Chrissy do?\' Why, split it into two parties, of course -- one for each parent. But complications inevitably ensue.', 'Y', 'N', 9),
	('Friends', 'The One With The Chicken Pox', 2, 23, 'Yes', 'Yes', 'No', 9, 5, 1996, 'Phoebe catches chicken pox just as her old flame Ryan arrives in town on leave from the Navy. Even though he hasn\'t yet had chicken pox, he can\'t stand to be apart and they both spend the rest of the time trying to not scratch. Joey gets a job at Chandler\'s office but decides to play it as a role. The character he creates, Joseph, has a wife and kids and ultimately blames Chandler for his own screwup. Monica is upset that Richard doesn\'t have a \'thing\': an unexplainable quirk. He eventually comes up with one to ease her mind.', 'Y', 'N', 8.2),
	('Friends', 'The One With Barry And Mindy\'s Wedding', 2, 24, 'Yes', 'Yes', 'No', 16, 5, 1996, 'Rachel agrees to be maid of honor at her ex-fiance\'s wedding, but a fashion faux pas focuses attention away from the bride. To get a role in Warren Beatty\'s new movie, Joey needs to practice kissing...guys. Monica ponders her future with Richard and Chandler falls for a mystery woman on the Internet...who turns out to be Janice!', 'Y', 'N', 8.3),
	('Friends', 'The One With The Princess Leia Fantasy', 3, 1, 'Yes', 'Yes', 'No', 16, 9, 1996, 'Ross reveals a fantasy to Rachel involving a certain \'Star Wars\' character. Monica suffers from insomnia after her breakup with Richard. And Chandler, back together with Janice, wants Joey to bond with her.', 'Y', 'N', 8.5),
	('Friends', 'The One Where No One\'s Ready', 3, 2, 'Yes', 'Yes', 'No', 26, 9, 1996, 'Ross is in a hurry to get everyone dressed for an important banquet at the museum but no one is co-operating. Chandler and Joey fight over who gets to sit in a comfortable chair. Monica acts goofy over a message on the answering machine from Richard. Rachel can\'t decide what to wear and Phoebe (the only one ready on time) gets a spot on her dress. When Ross gets so upset that no one is ready that he yells at Rachel. She is so upset that she decides to not go. Ross apologizes and is ready to drink a glass of fat to prove he is sorry when Rachel accepts the apology.', 'Y', 'N', 9),
	('Friends', 'The One With The Jam', 3, 3, 'Yes', 'Yes', 'No', 3, 10, 1996, 'Phoebe dates a man who thinks he\'s stalking her twin sister. Ross and Rachel give Chandler \'boyfriend\' lessons. Monica uses her free time after breaking up with Richard to make jam and considers insemination through a sperm bank.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Metaphorical Tunnel', 3, 4, 'Yes', 'Yes', 'No', 10, 10, 1996, 'Phoebe pretends to be Joey\'s agent and has some success in getting him auditions. Ultimately, however, she is unable to deal with the rejection that comes with acting, and quits. Ross is upset when Ben brings a Barbie doll on his weekend visit. He spends the time trying to get him to give up the doll and eventually replaces it with a G.I. Joe. When Carol and Susan come to pick up Ben, Monica tells them that Ross used to dress in his mother\'s clothes and play tea party. Chandler is advancing in his relationship with Janice and, realizing that he has a fear of commitment, goes to the girls for advice. When he decides to become super-committed, he ends up scaring Janice. He ends up just coming clean and being himself and the relationship survives.', 'Y', 'N', 8.2),
	('Friends', 'The One With Frank Jr', 3, 5, 'Yes', 'Yes', 'No', 17, 10, 1996, 'Phoebe\'s half-brother visits and she offers to give him a massage, but they have trouble bonding. Joey attempts to build an entertainment center. Ross is challenged to name the five celebrities he\'d like to sleep with most.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Flashback', 3, 6, 'Yes', 'Yes', 'No', 31, 10, 1996, 'When Janice asks the gang if any of them have ever slept together, the friends flash back to a time three years before.', 'Y', 'N', 9.1),
	('Friends', 'The One With The Race Car Bed', 3, 7, 'Yes', 'Yes', 'No', 7, 11, 1996, 'When Monica buys a new bed from Janice\'s soon-to-be-ex-husband, \'The Mattress King\', the wrong one is delivered. Rachel\'s attempts to have her father and Ross bond fail, until she stops trying. Joey gets a job teaching a soap opera acting class.', 'Y', 'N', 8.4),
	('Friends', 'The One With The Giant Poking Device', 3, 8, 'Yes', 'Yes', 'No', 14, 11, 1996, 'When Chandler is about to buy Janice an expensive gift, Joey tells him that he saw Janice kissing her ex-husband. Chandler confronts Janice and she admits that she is confused about what she should do and can\'t chose between the two men. After much soul-searching and some advice from Joey, Chandler realizes he has to let her go back and try to make things work with her husband. While Rachel is babysitting Ben, Monica accidentally bumps his head into a post. The girls attempt to hide the bump under a hat but Ben keeps saying \'Monica bang.\' When Ross finds the bump, he assumes that it was Rachel\'s fault, but she rats out Monica. Ross then gets to torture her by pretending Ben is seriously injured. Phoebe is convinced that she is cursed because every time she goes to the dentist, someone around her dies. After she is forced to go to the dentist, she calls everyone she knows and they are all alive. Ugly Naked Guy, however, has been lying in the same position without moving all day. The friends tie together a bunch of chopsticks into a giant poking device that they use to prod Ugly Naked Guy. He turns out to be alive and not very happy about being poked.', 'Y', 'N', 8.5),
	('Friends', 'The One With The Football', 3, 9, 'Yes', 'Yes', 'No', 21, 11, 1996, 'Emotions become the feast of the day when the gang plays a game of touch football on Thanksgiving as Joey and Chandler argue over who gets to date a model and Ross and Monica argue over winning in a case of sibling rivalry.', 'Y', 'N', 9.1),
	('Friends', 'The One Where Rachel Quits', 3, 10, 'Yes', 'Yes', 'No', 12, 12, 1996, 'Rachel makes a rash decision after Gunther tells her she needs to be retrained. Phoebe tries to help Joey when he gets a job selling Christmas trees. And Ross accidentally breaks a girl\'s leg and tries to make it up to her.', 'Y', 'N', 8.2),
	('Friends', 'The One Where Chandler Can\'t Remember Which Sister', 3, 11, 'Yes', 'Yes', 'No', 9, 1, 1997, 'Ross is suspicious about Rachel\'s possible job offer from a good-looking stranger. And a drunken Chandler fools around with one of Joey\'s sisters, but can\'t remember which one.', 'Y', 'N', 8.7),
	('Friends', 'The One With All The Jealousy', 3, 12, 'Yes', 'Yes', 'No', 16, 1, 1997, 'Ross becomes jealous when he thinks he catches Rachel\'s new coworker whispering sweet nothings in her ear. After Joey lies on his resume, he is forced to teach a very hard dance to an entire Broadway cast. And Monica dates a busboy who hates Americans.', 'Y', 'N', 8.4),
	('Friends', 'The One Where Monica And Richard Are Just Friends', 3, 13, 'Yes', 'Yes', 'No', 30, 1, 1997, 'Monica\'s willpower is tested when she runs into Richard at the video store. Joey agrees to read Little Women while Rachel agrees to read The Shining. And Phoebe\'s athletic date has a problem with short shorts.', 'Y', 'N', 8.4),
	('Friends', 'The One With Phoebe\'s Ex-Partner', 3, 14, 'Yes', 'Yes', 'No', 6, 2, 1997, 'Phoebe is reunited with her former singing partner, who thinks \'Smelly Cat\' has hit potential. Chandler dates a woman with a prosthetic leg. And Rachel\'s new job continues to put a strain on her relationship with Ross.', 'Y', 'N', 8),
	('Friends', 'The One Where Ross And Rachel Take A Break', 3, 15, 'Yes', 'Yes', 'No', 13, 2, 1997, 'Ross seeks solace at a party after a bitter fight with Rachel and ends up in the arms of another woman. Phoebe dates a diplomat who needs an interpreter to communicate with her. And Chandler and Joey ponder a manage a trois with a woman who seems hot for both of them.', 'Y', 'N', 8.7),
	('Friends', 'The One The Morning After', 3, 16, 'Yes', 'Yes', 'No', 20, 2, 1997, 'Ross tries to prevent Rachel from learning that he slept with Chloe, the copy store employee. When she finds out anyway and they go back to her apartment and have a fight, the other four friends are trapped in Monica\'s bedroom, forced to listen in as Rachel decides to break up with Ross.', 'Y', 'N', 9.1),
	('Friends', 'The One Without The Ski Trip', 3, 17, 'Yes', 'Yes', 'No', 6, 3, 1997, 'Ross and Rachel compete to spend time with their other friends. When a lonely Ross is excluded from Rachel\'s ski trip with her pals, he visits Carol. Meanwhile, Chandler starts smoking again.', 'Y', 'N', 8.4),
	('Friends', 'The One With The Hypnosis Tape', 3, 18, 'Yes', 'Yes', 'No', 13, 3, 1997, 'A desperate Monica agrees to a date with one of her restaurant customers, who turns out to be very, very well-off. Phoebe\'s half-brother visits and announces he is getting married to a much, much older woman. And Chandler uses a hypnosis tape to quit smoking, with surprising results.', 'Y', 'N', 8.5),
	('Friends', 'The One With The Tiny T-Shirt', 3, 19, 'Yes', 'Yes', 'No', 27, 3, 1997, 'Rachel goes on her first date after splitting from Ross...and it\'s with Mark. Joey develops a crush on his costar in his new play. And Monica continues to date Pete, even though she is still not attracted to him.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Dollhouse', 3, 20, 'Yes', 'Yes', 'No', 10, 4, 1997, 'Rachel regrets making a date for Chandler and her boss, Joanna. Joey\'s interest in Kate intensifies after they sleep together. And Monica\'s aunt dies, leaving her an antique dollhouse, with which Monica doesn\'t want Phoebe to play with.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Chick And The Duck', 3, 21, 'Yes', 'Yes', 'No', 17, 4, 1997, 'Monica considers a dream job in Pete\'s new restaurant, but Phoebe fears there is more to the deal. Joey and Chandler adopt a baby chick and a duck. And Ross misses a panel for the Discovery Channel to help Rachel, who may have a broken rib.', 'Y', 'N', 8.9),
	('Friends', 'The One With The Screamer', 3, 22, 'Yes', 'Yes', 'No', 24, 4, 1997, 'At the premiere of Joey\'s big play; Ross alone concludes that Rachel\'s date is insane. Joey falls in love with Kate, but she gets a big job in Los Angeles and takes it. And poor Phoebe is on hold for days with a company she needs to talk to before her phone warranty expires.', 'Y', 'N', 8.4),
	('Friends', 'The One With Ross\'s Thing', 3, 23, 'Yes', 'Yes', 'No', 1, 5, 1997, 'Afflicted with a mysterious skin condition on his butt, Ross seeks advice from Phoebe\'s herbalist. Phoebe can\'t decide whether to date a sensitive, muscular fireman or a sensitive, muscular schoolteacher. And Monica can\'t decide about Pete when she thinks he is going to propose.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Ultimate Fighting Champion', 3, 24, 'Yes', 'Yes', 'No', 8, 5, 1997, 'To Monica\'s horror, Pete plans to be in an ultimate fight, and when he can\'t win but won\'t give up, she must decide her future with him. Chandler has a problem when his new boss is slaphappy. Phoebe sets Ross up on a date with a woman who used to be bald.', 'Y', 'N', 8.3),
	('Friends', 'The One At The Beach', 3, 25, 'Yes', 'Yes', 'No', 15, 5, 1997, 'The gang goes to the beach. In search of her father, Phoebe meets a family friend with links to her family\'s past, who may know more than she\'s letting on. Ross discovers that Rachel still loves him, and must choose between sex-crazy, but bald, Bonnie and Rachel, the love of his life. After the gang plays strip poker, Joey winds up sleeping naked on the beach. And Chandler wonders why Monica doesn\'t think he\'s serious after he asks her if she would ever go out with him.', 'Y', 'N', 8.9),
	('Friends', 'The One With The Jellyfish', 4, 1, 'Yes', 'Yes', 'No', 25, 9, 1997, 'Ross chooses between Rachel and his bald-headed girlfriend Bonnie. Phoebe struggles to deal with the revelation that her mother\'s friend is actually her mother. Monica gets stung by a jellyfish, forcing Chandler and Joey to step up to the plate in order to relieve her pain.', 'Y', 'N', 9.1),
	('Friends', 'The One With The Cat', 4, 2, 'Yes', 'Yes', 'No', 2, 10, 1997, 'Phoebe believes that her adoptive mother\'s spirit resides in a cat that jumped into her guitar case in Central Perk. Monica goes on a date with Rachel\'s hunky high-school boyfriend, who was cool in high-school, but a failure now. And when Joey and Chandler decide to sell the entertainment center, Joey takes stupidity to a new level.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Cuffs', 4, 3, 'Yes', 'Yes', 'No', 9, 10, 1997, 'Monica caters a party for her mother, who still doesn\'t quite know how to talk to her daughter. Chandler\'s encounter with Rachel\'s boss leads to an embarrassing situation. And an encyclopedia salesman takes advantage of Joey.', 'Y', 'N', 8.6),
	('Friends', 'The One With The Ballroom Dancing', 4, 4, 'Yes', 'Yes', 'No', 16, 10, 1997, 'Joey attempts ballroom dancing in order to help Monica and Rachel keep their illegal sublet. Phoebe is attracted to one of her massage clients. And Chandler has trouble attempting to quit a gym.', 'Y', 'N', 8.3),
	('Friends', 'The One With Joey\'s New Girlfriend', 4, 5, 'Yes', 'Yes', 'No', 30, 10, 1997, 'Chandler hits on a woman at Central Perk, not realizing she is Joey\'s new girlfriend. He soon realizes he is very attracted to, possibly in love, with her. Ross and Rachel play the jealousy game in their relationships. And Phoebe desperately tries to catch a cold after discovering that her voice is sexier and her singing better when she has phlegm in her throat.', 'Y', 'N', 8.5),
	('Friends', 'The One With The Dirty Girl', 4, 6, 'Yes', 'Yes', 'No', 6, 11, 1997, 'Ross\'s new girlfriend seems nearly perfect until he visits her house and discovers that her apartment is incredibly dirty. Chandler helps Joey pick out a thoughtful present for Kathy\'s birthday. Rachel attempts to finish a crossword puzzle by herself. And Phoebe helps Monica cater a funeral.', 'Y', 'N', 8.6),
	('Friends', 'The One Where Chandler Crosses The Line', 4, 7, 'Yes', 'Yes', 'No', 13, 11, 1997, 'Chandler must decide between the girl of his dreams and his best friend when he and Kathy share a passionate kiss. Needless to say, Joey is not happy to find out about Kathy and Chandler. And nobody wants to tell Ross how awful his keyboard playing is.', 'Y', 'N', 8.8),
	('Friends', 'The One With Chandler In A Box', 4, 8, 'Yes', 'Yes', 'No', 20, 11, 1997, 'Chandler agrees to spend Thanksgiving in a shipping crate as penance for kissing Kathy. The gang decides to give each other Secret Santa gifts. After Monica gets ice in her eye, she ends up visiting Richard\'s son, who is as attracted to Monica as his father was.', 'Y', 'N', 9.2),
	('Friends', 'The One Where They\'re Going To Party!', 4, 9, 'Yes', 'Yes', 'No', 11, 12, 1997, 'Chandler and Ross\'s college friend Gandalf is planning to come to town. Gandalf is \'the party wizard.\' Ross and Chandler are very excited until Gandalf cancels. However, they decide to make their own party with Joey\'s help. Joanna squashes Rachel\'s chance at a promotion. And when Monica fills in for a friend as food critic for a small newspaper, she must decide between a steady job as head chef of a restaurant she panned or keeping her catering business with her friend Phoebe.', 'Y', 'N', 8.1),
	('Friends', 'The One With The Girl From Poughkeepsie', 4, 10, 'Yes', 'Yes', 'No', 18, 12, 1997, 'Ross must decide whether to continue dating a girl he must travel two-and-a-half hours to see. Chandler sets Rachel up with a coworker who misunderstands her intentions. Monica is being treated poorly by her new coworkers so she hires Joey just so she can fire him and show who\'s the boss. And Phoebe tries to write the perfect holiday song.', 'Y', 'N', 8.2),
	('Friends', 'The One With Phoebe\'s Uterus', 4, 11, 'Yes', 'Yes', 'No', 8, 1, 1998, 'Phoebe considers her options when her brother visits with his new wife and asks her to carry their child. Joey works as a tour guide at Ross\'s museum and tries to tear down the walls between tour guides and scientists. And Chandler seeks advice from Monica and Rachel after he fears that he will not live up to Kathy\'s sexual expectations--especially since the last guy she slept with before him was Joey.', 'Y', 'N', 8.6),
	('Friends', 'The One With The Embryos', 4, 12, 'Yes', 'Yes', 'No', 15, 1, 1998, 'Joey and Chandler guess all the items that Monica and Rachel had in a bag after coming home from the market. This starts a competition between the boys and the girls, a question-answer game created by Ross. The sex that knows the most about the other one wins. Meanwhile, Phoebe goes to the doctor to get the embryos implanted in her uterus. The game ends tied, so Ross prepares the \'Lightning Round.\' Monica and Chandler raise the bet: if the girls win, the boys get rid of the chick and the duck, but if the boys win, they have to switch apartments. At the end, the boys win because the girls don\'t know Chandler\'s job. Just when the two couples are changing apartments, Phoebe surprises everyone announcing she is pregnant.', 'Y', 'N', 9.4),
	('Friends', 'The One With Rachel\'s Crush', 4, 13, 'Yes', 'Yes', 'No', 29, 1, 1998, 'Chandler can\'t deal with the fact that Kathy simulates sex, half-naked, in a play, with a very handsome man. After Rachel is demoted to personal shopper, she is in a hard place after she discovers that she likes a customer. And Monica wants to play hostess again after telling Joey that since he now has the bigger apartment, he must constantly have company over.', 'Y', 'N', 8.4),
	('Friends', 'The One With Joey\'s Dirty Day', 4, 14, 'Yes', 'Yes', 'No', 5, 2, 1998, 'After a three-day fishing trip with his dad, Joey is in a jam when he doesn\'t have time to take a shower before going to the set of Charlton Heston\'s new movie. Rachel, continuing to fawn over clothing shopper Joshua, sets Ross up with her boss\'s niece when she is unable to take her to the opera. Ross ends up spending a weekend in Vermont with the niece, Emily. And while Chandler is despondent after his breakup with Kathy, the girls take him to a strip club.', 'Y', 'N', 8.4),
	('Friends', 'The One With All The Rugby', 4, 15, 'Yes', 'Yes', 'No', 26, 2, 1998, 'Ross and Emily run into some of Emily\'s rugby playing friends from England. After Emily laughs at the idea of Ross playing rugby, he insists on playing even though the others are much bigger and more athletic. He proceeds to get beaten badly until Emily tells him all the other players\' physical weaknesses so that he can inflict some pain of his own. Chandler runs into Janice and in an attempt to head off a relationship before it starts says that he is moving to Yemen. Unable to get away from Janice or find a way out of his lie, he ends up packing his belongings and heading out on a flight bound for Yemen. Monica, recently moved into the guys former apartment, goes nuts because she can\'t figure out what a light switch does. After making holes in the wall to follow the wire and calling the super and an electrician, she gives up. As she flips the switch off and on, we see the TV in the girls old apartment turn off and on.', 'Y', 'N', 8.5),
	('Friends', 'The One With The Fake Party', 4, 16, 'Yes', 'Yes', 'No', 19, 3, 1998, 'With two days left until Emily\'s departure back to England, Rachel throws a fake party for her, just so that she can see Joshua outside of work. And a pregnant (vegetarian) Phoebe craves meat.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Free Porn', 4, 17, 'Yes', 'Yes', 'No', 26, 3, 1998, 'Chandler and Joey discover that they\'re getting a free porno station on their TV. Mr. Treeger advises them not to turn it off. Monica convinces Ross to tell Emily how he really feels before her plane leaves. At an OB/GYN appointment, Phoebe discovers that she is carrying triplets. However, Frank Jr. and Alice are not prepared for triplets. Ross tells Emily he loves her, but she gets on her plane anyway. Phoebe looks for ways to make money. Emily calls Ross from London. Monica convinces Ross to go to London. While Ross is in London, Emily shows up at Joey and Chandler\'s. Over the phone, she tells Ross that she loves him.', 'Y', 'N', 8.7),
	('Friends', 'The One With Rachel\'s New Dress', 4, 18, 'Yes', 'Yes', 'No', 2, 4, 1998, 'A very pregnant Phoebe is asked to name one of the triplets. Emily offers to show Susan around London. Rachel tries to prepare the perfect evening for herself and Joshua. Emily loves Susan. Phoebe decides that the boy will be named either Chandler or Joey. Joey accidentally tells Chandler he has an awful name. The chick and duck wander over to Rachel\'s apartment and freak out Joshua, so they go to his parents\' house. Ross worries about losing another woman to Susan. Joshua\'s parents come home unexpectedly. Chandler disowns his name and tries to find himself a new name. The girls convince Ross not to let what happened with Carol happen with Emily. In order to keep Chandler from legally changing his name, Phoebe decides to name the baby Chandler. Chandler reveals to Joey that it was all a trick.', 'Y', 'N', 8.4),
	('Friends', 'The One With All The Haste', 4, 19, 'Yes', 'Yes', 'No', 9, 4, 1998, 'Monica and Rachel are tired of their new apartment. Ross, sporting an earring, wants Emily to stay as she prepares to leave again. Phoebe is wearing \'santa\' pants. Monica and Rachel try to bribe Joey and Chandler into giving up their apartment for Knicks tickets. They play high card for the apartment and tickets and Joey and Chandler win. Ross asks Emily to move in with him, but changes his mind and asks her to marry him. She says yes. While Joey and Chandler are at the Knicks game, Monica and Rachel switch the apartments. And when Ross and Emily tell the gang, Rachel tries to put on a happy face.', 'Y', 'N', 8.8),
	('Friends', 'The One With All The Wedding Dresses', 4, 20, 'Yes', 'Yes', 'No', 16, 4, 1998, 'A snoring Joey is keeping Chandler awake. Ross asks Monica to pick up Emily\'s wedding dress for him. Ross talks to Rachel about the wedding and she says she\'s fine with it because of Joshua. Monica tries on Emily\'s wedding dress and keeps it on. Chandler sends Joey to a sleep clinic. Phoebe gets her own wedding dress. Rachel predicts that Ross and Emily will not last because of their hasty engagement; however, Ross announces that they have decided to marry in a month in London. Rachel proposes to Joshua and he turns her down. Chandler meets a woman at the sleep clinic. Phoebe and Monica find life in wedding attire has its charm. Joey gets a mouth guard to stop him from snoring. Rachel confides to Monica and Phoebe that she\'s not okay with Ross\'s marriage after breaking up with Joshua. Chandler\'s new girlfriend screams in her sleep and keeps Joey awake.', 'Y', 'N', 8.6),
	('Friends', 'The One With The Invitation', 4, 21, 'Yes', 'Yes', 'No', 23, 4, 1998, 'Ross and Emily discuss who to invite to their wedding. He wants to invite Rachel while Emily thinks it\'s odd. Ross sends her an invitation anyway. The gang receives their invitations, all except for Chandler, as they reminisce about Ross and Rachel\'s up-and-down relationship. However, a very pregnant Phoebe can\'t go. Rachel wrestles with the idea of going to the wedding and after deciding against it, breaks down and cries on Monica\'s shoulder.', 'Y', 'N', 7.4),
	('Friends', 'The One With The Worst Best Man Ever', 4, 22, 'Yes', 'Yes', 'No', 30, 4, 1998, 'Phoebe is tired of being pregnant and experiencing major mood swings. Ross chooses Joey as his best man. The girls decide to throw Phoebe a baby shower after they\'re not invited to the bachelor party. Joey orders strippers after Ross says not to. Monica and Rachel get Phoebe presents that she can use after her pregnancy because she can\'t keep the babies. Chandler tries to draw attention away from Joey at the bachelor party. Joey sleeps with the stripper and awakes to find Emily\'s ring missing and the stripper gone. The guys set up a sting to get the ring back. Phoebe experiences false labor. It turns out that the stripper didn\'t take the ring but the duck ate it. Ross decides to have two best men.', 'Y', 'N', 8.6),
	('Friends', 'The One With Ross\'s Wedding - 1', 4, 23, 'Yes', 'Yes', 'No', 7, 5, 1998, 'Monica freaks out about the trip to London. Joey annoys Chandler by saying \'London, baby\' over and over. Ross is annoyed that Rachel won\'t come. In London, Chandler is embarrassed about touring with Joey. Emily worries about the wedding and Ross reassures her. Rachel tries taking care of Phoebe but Phoebe clues her in to her feelings for Ross. Joey buys an ugly hat and Chandler goes back to the hotel. Monica gives Emily advice, so Emily decides to postpone the wedding and she and Ross argue. Phoebe tries to help Rachel get over Ross. Joey shows Chandler highlights of his trip on video camera, including his meeting with the Duchess of York. Ross confronts Monica, who agrees to help him. Ross and Emily make up and decide to go ahead as planned. Rachel decides to go to London and Phoebe tries to talk her out of it.', 'Y', 'N', 8.9),
	('Friends', 'The One With Ross\'s Wedding - 2', 4, 24, 'Yes', 'Yes', 'No', 7, 5, 1998, 'Phoebe calls to warn Emily of Rachel\'s impending arrival, but can\'t get through. The parents meet at the rehearsal dinner. Joey is homesick, but one of the bridesmaids fixes that. Rachel forgets her passport, but is soon on her way anyway. Chandler and Joey make toasts as the parents squabble. A drunken Chandler and Monica sleep together. Phoebe talks to Joey and warns him. Monica and Chandler act awkwardly around each other. The bridesmaid distracts Joey and Rachel sneaks through into the church. Ross is surprised but Rachel doesn\'t tell him of her feelings. Monica and Chandler decide to meet later.', 'Y', 'N', 9.2),
	('Friends', 'The One After Ross Says Rachel', 5, 1, 'Yes', 'Yes', 'No', 24, 9, 1998, 'In the aftermath of his Freudian slip, Ross tries to rescue his marriage with Emily. Meanwhile, Chandler and Monica try and find a moment alone in order to continue their affair while overseas.', 'Y', 'N', 9),
	('Friends', 'The One With All The Kissing', 5, 2, 'Yes', 'Yes', 'No', 1, 10, 1998, 'Ross continues to try and mend his marriage to Emily. When Chandler accidentally kisses Monica in front of everyone before leaving for work, he tries to recover by kissing everyone. Meanwhile, Phoebe starts getting irritated by everyone\'s London stories.', 'Y', 'N', 9),
	('Friends', 'The One Hundredth', 5, 3, 'Yes', 'Yes', 'No', 8, 10, 1998, 'Phoebe is rushed to the hospital for the birth of her brother\'s triplets. While there, Joey winds up with severe sympathy pains that turn out to be kidney stones. Meanwhile, Rachel tries to set Monica up on a date with a male nurse.', 'Y', 'N', 8.8),
	('Friends', 'The One Where Phoebe Hates Pbs', 5, 4, 'Yes', 'Yes', 'No', 15, 10, 1998, 'Joey lands a job with a PBS telethon, which ignites an old hatred Phoebe has towards the network. Meanwhile, Monica tries to convince Rachel that she\'s dating someone from work to hide her relationship with Chandler.', 'Y', 'N', 8.4),
	('Friends', 'The One With The Kips', 5, 5, 'Yes', 'Yes', 'No', 29, 10, 1998, 'Monica and Chandler plan an Atlantic City getaway in order to have an intimate weekend away from their friends. Meanwhile, Ross prepares himself to tell Rachel that he can\'t see her anymore.', 'Y', 'N', 8.8),
	('Friends', 'The One With The Yeti', 5, 6, 'Yes', 'Yes', 'No', 5, 11, 1998, 'Emily decides that the only way to continue her marriage with Ross is to have him get rid of all traces of Rachel in his apartment. Meanwhile, Rachel and Monica mistake a hairy neighbor for a yeti.', 'Y', 'N', 8.2),
	('Friends', 'The One Where Ross Moves In', 5, 7, 'Yes', 'Yes', 'No', 12, 11, 1998, 'Chandler and Joey let Ross move in with them once his marriage to Emily falls apart. Meanwhile, Phoebe gets involved with the local health inspector and Rachel becomes convinced that Danny is trying to seduce her with mind games.', 'Y', 'N', 8.5),
	('Friends', 'The One With All The Thanksgivings', 5, 8, 'Yes', 'Yes', 'No', 19, 11, 1998, 'Although the Thanksgiving meal is great, Chandler is still moody over his parent\'s divorce during the holiday when he was a boy and Ross is depressed about his second divorce. The group reminisces about their worst Thanksgivings in order to cheer them up, and Monica\'s worst memory is revealed.', 'Y', 'N', 9.2),
	('Friends', 'The One With Ross\'s Sandwich', 5, 9, 'Yes', 'Yes', 'No', 10, 12, 1998, 'Joey starts to get uncomfortable with protecting Monica and Chandler\'s secret, especially when it places him in embarrassing situations with the rest of the group. Meanwhile, Ross becomes enraged at work when someone swipes his turkey sandwich.', 'Y', 'N', 9.1),
	('Friends', 'The One With The Inappropriate Sister', 5, 10, 'Yes', 'Yes', 'No', 17, 12, 1998, 'Joey teaches Ross how to be unemployed. Phoebe is working for the Salvation Army during the holidays. Monica is tired of Rachel\'s obsessing about Danny and asks him to go out with her. Ross convinces Joey to write a play about himself. Phoebe is distressed after finding out that New Yorkers are mean. Rachel meets Danny\'s sister and is dismayed when the two seem a little too playful. Phoebe vows a return to \'Street Phoebe.\'', 'Y', 'N', 8.3),
	('Friends', 'The One With All The Resolutions', 5, 11, 'Yes', 'Yes', 'No', 7, 1, 1999, 'With the New Year, the friends make New Year\'s resolutions. Ross resolves to try a new thing every day. Chandler resolves to not make fun of his friends for a week. Joey resolves to learn how to play the guitar, with Phoebe as his teacher. Rachel resolves to give up gossiping. Chandler nearly goes insane holding it all in. Ross is stuck in a sticky situation at his date\'s apartment, in constricting and hot leather pants. Rachel discovers a big secret (Monica and Chandler) that threatens to spoil her resolution.', 'Y', 'N', 9.1),
	('Friends', 'The One With Chandler\'s Work Laugh', 5, 12, 'Yes', 'Yes', 'No', 21, 1, 1999, 'Monica begins to hang out with Chandler during his work functions, since they don\'t have to keep their relationship a secret among his coworkers. However, she learns that Chandler has a second, more annoying personality when he\'s around his boss. Meanwhile, Ross learns that Emily is getting remarried and in his grief hooks up with an old nemesis of the gang: Janice.', 'Y', 'N', 8.4),
	('Friends', 'The One With Joey\'s Bag', 5, 13, 'Yes', 'Yes', 'No', 4, 2, 1999, 'Monica gives Chandler a painful massage. Joey wears a top hat for an audition. A disgusted Rachel offers to dress him. Phoebe\'s grandmother died. Rachel hooks Joey up with a \'shoulder bag\'. Phoebe tells Ursula, who is disinterested. At the memorial service, Phoebe meets her father, who plays it off and runs away. At his audition, Joey\'s bag distracts the casting people. Phoebe and her father talk at Central Perk.', 'Y', 'N', 8.2),
	('Friends', 'The One Where Everybody Finds Out', 5, 14, 'Yes', 'Yes', 'No', 11, 2, 1999, 'When the friends discover that Ugly Naked Guy is moving out of his apartment, Ross leaps at the opportunity to get his own place again. Phoebe finds out about Monica and Chandler\'s relationship, and tries to get them to reveal the truth by seducing Chandler.', 'Y', 'N', 9.7),
	('Friends', 'The One With The Girl Who Hits Joey', 5, 15, 'Yes', 'Yes', 'No', 18, 2, 1999, 'Joey starts dating Katie, a little girl who packs a mean punch. When Ross refuses to contribute to the retirement fund of the building\'s maintenance man, he winds up offending everyone in the building.', 'Y', 'N', 8.6),
	('Friends', 'The One With The Cop', 5, 16, 'Yes', 'Yes', 'No', 23, 2, 1999, 'Joey has a dream about Monica. Phoebe finds a police badge under her seat at Central Perk and uses it to go on missions of mercy. Ross buys a sofa but has trouble moving it up the stairs into his new apartment.', 'Y', 'N', 8.6),
	('Friends', 'The One With Rachel\'s Inadvertent Kiss', 5, 17, 'Yes', 'Yes', 'No', 18, 3, 1999, 'Monica and Chandler try to prove that they\'re more hot and heavy than Phoebe and Gary. Rachel accidentally kisses her job interviewer at Ralph Lauren. Joey tries to meet a girl living in Ross\'s building, but Ross meets her first.', 'Y', 'N', 8.6),
	('Friends', 'The One Where Rachel Smokes', 5, 18, 'Yes', 'Yes', 'No', 8, 4, 1999, 'Rachel decides to start smoking in order to avoid missing important meetings with her boss. Meanwhile, Ben gets offered an audition for a soup commercial, and Joey auditions to be Ben\'s father during the ad. Also, Monica and Phoebe plan a surprise birthday party for Rachel together, but Monica takes over.', 'Y', 'N', 8.1),
	('Friends', 'The One Where Ross Can\'t Flirt', 5, 19, 'Yes', 'Yes', 'No', 22, 4, 1999, 'Joey lands a role in Law & Order, and his Italian-speaking grandmother comes over to watch his network debut. Meanwhile, Ross tries unsuccessfully to flirt with the pizza delivery girl.', 'Y', 'N', 8.8),
	('Friends', 'The One With The Ride-Along', 5, 20, 'Yes', 'Yes', 'No', 29, 4, 1999, 'As the date for Emily\'s remarriage draws closer, the group tries to keep Ross distracted. As a result, Ross and the other guys get invited to take a ride along with Gary.', 'Y', 'N', 8.4),
	('Friends', 'The One With The Ball', 5, 21, 'Yes', 'Yes', 'No', 6, 5, 1999, 'Rachel buys a psychotic sphynx cat and Phoebe learns that Gary is going to ask her to move in with him. Thinking this is way to fast, she tries to get Chandler to talk him out of this decision. Ross and Joey start throwing a ball while they are bored but it changes from a time-filler to a super-competitive obsession when Monica joins in.', 'Y', 'N', 8.6),
	('Friends', 'The One With Joey\'s Big Break', 5, 22, 'Yes', 'Yes', 'No', 13, 5, 1999, 'Joey seems to have finally hit big when he gets offered a lead part in a movie shooting outside of Las Vegas. However, when Chandler begins expressing doubts about the film\'s legitimacy, it causes a rift in their friendship.', 'Y', 'N', 8.4),
	('Friends', 'The One In Vegas - 1', 5, 23, 'Yes', 'Yes', 'No', 20, 5, 1999, 'Chandler decides the only way to mend his friendship with Joey is to fly out to Vegas and visit him. Phoebe is determined not to be left out on another adventure, so everyone winds up going. Trouble is in the water, however, when Chandler finds out that Monica had lunch with Richard.', 'Y', 'N', 8.9),
	('Friends', 'The One In Vegas - 2', 5, 24, 'Yes', 'Yes', 'No', 20, 9, 1999, 'Ross draws a mustache on Rachel\'s face, which won\'t come off. Chandler prepares to go back to New York but Monica stops him. Joey tries to find his hand twin. Rachel refuses to leave her room and Ross desperately tries to make it up to her. Monica and Chandler are on a big roll. Chandler proposes to Monica; her response will be based on a throw of the dice. She rolls a hard eight and says yes. Rachel and Ross get drunk; he paints his face and they leave the room together. Phoebe gets kicked out of the casino but comes back in to annoy the \'\'hand twin.\'\' Monica and Chandler go to the chapel to get married...only to find out that the drunk Ross and Rachel got there first...', 'Y', 'N', 9.1),
	('Friends', 'The One After Vegas', 6, 1, 'Yes', 'Yes', 'No', 23, 9, 1999, 'Ross and Rachel experience the world\'s worst hangover when they realize they\'ve gotten married. Chandler and Monica back away from their own altar plans. Phoebe and Joey head back to New York in the taxi cab.', 'Y', 'N', 8.8),
	('Friends', 'The One Where Ross Hugs Rachel', 6, 2, 'Yes', 'Yes', 'No', 30, 9, 1999, 'Monica and Chandler decide to move in together, leading Rachel to believe that all three of them will be roommates, and Monica doesn\'t want to tell her the truth. Meanwhile, Ross tries to keep Rachel from learning that their marriage hasn\'t been annulled.', 'Y', 'N', 8.3),
	('Friends', 'The One With Ross\'s Denial', 6, 3, 'Yes', 'Yes', 'No', 7, 10, 1999, 'Monica and Chandler disagree over how to redecorate Rachel\'s old room. Joey advertises for a \'non ugly\' roommate. Ross is unwilling to accept that he is still in love with Rachel.', 'Y', 'N', 8.4),
	('Friends', 'The One Where Joey Loses His Insurance', 6, 4, 'Yes', 'Yes', 'No', 14, 10, 1999, 'Rachel prepares to move in with Ross. Ross is asked to give a lecture at NYU. Phoebe\'s psychic tells her that she will die before the end of the week. Ross practices his lecture for the gang but it\'s really boring. Joey\'s SAG health insurance has lapsed due to his lack of work. Ross\'s lecture goes well, without jokes or \'naked chicks\'. Joey gets a hernia working out for auditions. Rachel and Monica discover that Ross is interesting because he uses a British accent. Joey won\'t go to the hospital and Phoebe\'s psychic dies instead of her. Ross\'s lawyer calls for him and Rachel talks to him, discovering that they\'re still married.', 'Y', 'N', 8.6),
	('Friends', 'The One With Joey\'s Porsche', 6, 5, 'Yes', 'Yes', 'No', 21, 10, 1999, 'The gang is mad at Ross. Joey tries to find the owner of a Porsche who left their keys in Central Perk. Monica and Chandler agree to baby-sit Frank and Alice\'s triplets for Phoebe. Rachel decides to move in with Phoebe. The Porsche owner finds Joey. Rachel and Ross see the judge. Rachel\'s allegations are untrue, so the annulment can\'t be granted. Joey buys Porsche clothes. Chandler gets a toy stuck in his throat and goes to the hospital with Monica, leaving Phoebe alone with the mischievous triplets. Rachel and Ross sign divorce papers.', 'Y', 'N', 8.3),
	('Friends', 'The One On The Last Night', 6, 6, 'Yes', 'Yes', 'No', 4, 11, 1999, 'Chandler and Monica are moving in with each other, which means Rachel is moving in with Phoebe and Joey will be without a roommate. Meanwhile Ross doesn\'t want to help with the packing so he stays at home with Ben, or so they think. Joey doesn\'t know how to live by himself, so Chandler decides to \'lose\' money to him in various games.', 'Y', 'N', 8.6),
	('Friends', 'The One Where Phoebe Runs', 6, 7, 'Yes', 'Yes', 'No', 11, 11, 1999, 'Rachel and Phoebe decide to start running together, but Rachel is thrown off by the fact that Phoebe runs like a four-year-old. Joey finds a sexy new female roommate. Chandler decides to surprise Monica by cleaning the apartment, but forgets where everything goes. Ross tries to help him fix the apartment before Monica gets home.', 'Y', 'N', 8.5),
	('Friends', 'The One With Ross\'s Teeth', 6, 8, 'Yes', 'Yes', 'No', 18, 11, 1999, 'Ross bleaches his teeth for a date with Monica\'s coworker. The only problem is that they now glow in the dark. Chandler convinces Joey that Janine is trying to take over his apartment. Phoebe makes out with the copy guy at Rachel\'s office. Rachel spreads rumors about Phoebe but her boss thinks that Rachel slept with Ralph Lauren.', 'Y', 'N', 8.6),
	('Friends', 'The One Where Ross Got High', 6, 9, 'Yes', 'Yes', 'No', 25, 11, 1999, 'Monica\'s parents come for Thanksgiving, which is a problem because, not only do they not like Chandler, they don\'t know where he\'s living. Rachel makes a dessert--with beef. Phoebe develops a crush on Mr. Geller. Joey and Ross can\'t wait for dinner to end so they can go to Janine\'s \'Thanksgiving with models\'.', 'Y', 'N', 9.2),
	('Friends', 'The One With The Routine', 6, 10, 'Yes', 'Yes', 'No', 16, 12, 1999, 'Joey is beginning to like Janine more. She gets an invitation to dance on \'Dick Clark\'s New Year\'s Rockin\' Eve\' and invites Joey, Monica and Ross to join her. Monica and Ross are a little TOO happy. While Monica is at the taping, Rachel, Phoebe and Chandler search for their Christmas presents. Joey and Janine kiss.', 'Y', 'N', 8.6),
	('Friends', 'The One With The Apothecary Table', 6, 11, 'Yes', 'Yes', 'No', 6, 1, 2000, 'Rachel orders an apothecary table from Pottery Barn, which is a problem because Phoebe hates the mass-producing company. After Janine and Joey double date with Chandler and Monica, Janine tells Joey that she thinks the other two are boring. Ross buys a new apothecary table too, which causes problems for Rachel. After a confrontation with Monica and Chandler, Joey breaks up with Janine and she moves out.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Joke', 6, 12, 'Yes', 'Yes', 'No', 13, 1, 2000, 'Chandler and Ross fight over ownership of a joke published in Playboy. A wayward remark of Phoebe\'s leads to trouble between the girls and a broke Joey starts working at Central Perk.', 'Y', 'N', 8.2),
	('Friends', 'The One With Rachel\'s Sister', 6, 13, 'Yes', 'Yes', 'No', 3, 2, 2000, 'Joey gets in trouble for giving female customers free food at Central Perk. A sick Monica desperately tries to convince Chandler that she\'s not sick. After her father cuts her off, Rachel\'s sister Jill comes to town. Rachel talks Jill into asking Ross out. Ross and Jill return to his apartment and he closes the drapes as Rachel looks on from Monica and Chandler\'s...', 'Y', 'N', 8.3),
	('Friends', 'The One Where Chandler Can\'t Cry', 6, 14, 'Yes', 'Yes', 'No', 10, 2, 2000, 'Chandler admits that he hasn\'t cried since he was a child. Phoebe discovers that Ursula is starring in porno movies using her name. Rachel desperately tries to stop Ross and Jill from starting a relationship.', 'Y', 'N', 8.7),
	('Friends', 'The One That Could Have Been - 1', 6, 15, 'Yes', 'Yes', 'No', 17, 2, 2000, 'Barry and Mindy\'s impending divorce prompts the gang to fantasize about what their lives might be like if they\'d all taken different courses. Ross is still married to Carol, and Rachel is married to Barry, but fawning over famous soap star Joey Tribbiani. Monica is still fat and dating a doctor. Chandler is an aspiring writer and Phoebe is a Wall Street shark for Merrill Lynch.', 'Y', 'N', 8.6),
	('Friends', 'The One That Could Have Been - 2', 6, 16, 'Yes', 'Yes', 'No', 17, 2, 2000, 'Carol and Ross decide to have a threesome to spice up their marriage. Rachel goes to Joey\'s and kisses him. Chandler and Monica have sex and end up together anyway. Susan meets Carol. Rachel catches Barry cheating.', 'Y', 'N', 8.6),
	('Friends', 'The One With Unagi', 6, 17, 'Yes', 'Yes', 'No', 24, 2, 2000, 'Joey needs money for new headshots, and tries to enter a medical study. The only problem is that the study is for twins. Rachel and Phoebe are taking a self-defense class, but Ross tries to give them a lesson in Unagi instead. Chandler needs a homemade present for Monica\'s Valentine\'s Day present.', 'Y', 'N', 9.1),
	('Friends', 'The One Where Ross Dates A Student', 6, 18, 'Yes', 'Yes', 'No', 9, 3, 2000, 'Ross gets his student evaluations and one student writes that he\'s hot. Even though it could cost him his job, he considers dating her. An ex-girlfriend of Chandler\'s from college is directing the new Al Pacino movie and Joey wants an audition. A fire starts in Phoebe and Rachel\'s apartment, forcing them to find temporary living spaces with Monica and Joey.', 'Y', 'N', 8.4),
	('Friends', 'The One With Joey\'s Fridge', 6, 19, 'Yes', 'Yes', 'No', 23, 3, 2000, 'Phoebe and Monica & Chandler compete to get Rachel a date for a charity ball. Joey\'s fridge is broken and he tries to cajole his friends into helping him buy a new one. Elizabeth tells Ross her intention to visit Daytona Beach for spring break, making him nervous.', 'Y', 'N', 8.4),
	('Friends', 'The One With Mac And C.H.E.E.S.E.', 6, 20, 'Yes', 'Yes', 'No', 13, 4, 2000, 'Joey gets an audition for the lead character in a new TV show. When the audition is rescheduled, Chandler takes the message but forgets to tell Joey. Then the group recalls some of Joey\'s less-than-spectacular acting moments.', 'Y', 'N', 7.6),
	('Friends', 'The One Where Ross Meets Elizabeth\'s Dad', 6, 21, 'Yes', 'Yes', 'No', 27, 4, 2000, 'Ross asks his friends to keep him company when he meets Elizabeth\'s dad for the first time. Paul ends up hitting it off with Rachel. Phoebe decides to write \'another\' book, about Monica and Chandler. Joey may be fired from his sitcom when he has a fight with C.H.E.E.S.E.\'s operator.', 'Y', 'N', 8.7),
	('Friends', 'The One Where Paul\'s The Man', 6, 22, 'Yes', 'Yes', 'No', 4, 5, 2000, 'While visiting an art museum, Monica puts her name on a two-year waiting list to use the museum for a wedding. When Paul threatens to fire Ross if he doesn\'t stop seeing his daughter, Ross and Elizabeth take a trip up to her dad\'s mountain cabin. Unfortunately, Paul has the same idea and takes Rachel up to the cabin.', 'Y', 'N', 9),
	('Friends', 'The One With The Ring', 6, 23, 'Yes', 'Yes', 'No', 11, 5, 2000, 'Chandler and Phoebe shop for a ring for Monica. Chandler finds the perfect one but Phoebe accidentally lets it get away. Rachel wants Paul to open up, but he opens up a bit too much. Ross and Joey think that Chandler\'s mad at them because he\'s preoccupied with the ring.', 'Y', 'N', 8.7),
	('Friends', 'The One With The Proposal - 1', 6, 24, 'Yes', 'Yes', 'No', 18, 5, 2000, 'Chandler plans to propose to Monica at dinner, but his plans go awry when Richard shows up. Phoebe and Joey join Rachel at a charity auction.', 'Y', 'N', 8.8),
	('Friends', 'The One With The Proposal - 2', 6, 25, 'Yes', 'Yes', 'No', 18, 5, 2000, 'Monica struggles to decide between Richard and Chandler. Meanwhile, Rachel and Phoebe discuss their backup plans if they are not married before the time they\'re 40.', 'Y', 'N', 9.2),
	('Friends', 'The One With Monica\'s Thunder', 7, 1, 'Yes', 'Yes', 'No', 12, 10, 2000, 'Everybody toasts the engagement. Phoebe wants to be the musician at the wedding. Joey prepares for an audition where he must play a 19-year-old. After Chandler can\'t get it up for Monica, he worries about the consequences. Ross and Rachel debate a \'bonus night\'. Monica catches them kissing and thinks Rachel is trying to steal her night.', 'Y', 'N', 8.4),
	('Friends', 'The One With Rachel\'s Book', 7, 2, 'Yes', 'Yes', 'No', 12, 10, 2000, 'Everybody begins planning for the wedding. Phoebe moves in with Ross. Napping in Rachel\'s bed because the duck threw up in his, Joey discovers that Rachel has been reading a trashy romance novel. Phoebe moves her massage parlor in Ross\'s apartment. Monica\'s parents spent her wedding money on a beach house, but Chandler has enough saved for a decent wedding.', 'Y', 'N', 8.4),
	('Friends', 'The One With Phoebe\'s Cookies', 7, 3, 'Yes', 'Yes', 'No', 19, 10, 2000, 'Rachel tries to teach Joey how to sail his boat but turns into an overbearing perfectionist. They both decide it\'s more fun to sit in the boat at the dock and drink beer. Chandler plays racquetball with Monica\'s father and accidentally sits on his lap in the steam room...while they\'re both naked. Monica tries desperately to reproduce Phoebe\'s grandmother\'s secret cookie recipe only to discover that they are simple Nestle\'s Tollhouse cookies and the recipe is right there on the package.', 'Y', 'N', 8.3),
	('Friends', 'The One With Rachel\'s Assistant', 7, 4, 'Yes', 'Yes', 'No', 26, 10, 2000, 'While hiring a new assistant, Rachel is torn between hiring a much more qualified woman, or a handsome but inexperienced young man. Monica, Chandler and Ross engage in a war of secret sharing after Monica and Chandler vow to be more honest. Joey has problems when his TV show is cancelled after just one airing.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Engagement Picture', 7, 5, 'Yes', 'Yes', 'No', 2, 11, 2000, 'While taking an engagement picture for himself and Monica, Chandler cannot make anything but a weird face. Rachel enlists Joey to take Tag out for a night on the town. Phoebe and Ross date a couple in the middle of a divorce.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Nap Partners', 7, 6, 'Yes', 'Yes', 'No', 9, 11, 2000, 'Rachel and Phoebe compete to be Monica\'s maid-of-honor. Joey and Ross find themselves in awkward positions after a nap. Monica insists that Chandler apologize to an ex-girlfriend for dumping her because of a weight gain.', 'Y', 'N', 9),
	('Friends', 'The One With Ross\'s Library Book', 7, 7, 'Yes', 'Yes', 'No', 16, 11, 2000, 'Rachel and Phoebe convince Joey to keep dating a girl that they are like. However, the girls must decide whether to tell Joey when they find out that she\'s not interested in a serious relationship with him. Monica unintentionally invites Janice to her wedding and she and Chandler are unable to tactfully uninvite her. Ross is proud to find his thesis in the library but gets upset when he discovers it is in a section that is so deserted that students go there to make out.', 'Y', 'N', 8.6),
	('Friends', 'The One Where Chandler Doesn\'t Like Dogs', 7, 8, 'Yes', 'Yes', 'No', 23, 11, 2000, 'Ross drives himself insane when he can\'t name all 50 states in a simple game. Tag joins the gang for Thanksgiving dinner, where Joey accidentally spills the beans about Rachel\'s crush on him. Phoebe sneaks a dog into the apartment, making Chandler extremely nervous.', 'Y', 'N', 8.3),
	('Friends', 'The One With All The Candy', 7, 9, 'Yes', 'Yes', 'No', 7, 12, 2000, 'When Phoebe tells the gang about how she was too poor to have a bike as a child, Ross goes out and buys her one. Phoebe loves the bike but the gang soon discovers that she doesn\'t know how to ride a bike. Ross decides to teach her. Rachel writes a playful work evaluation of Tag that he accidentally turns in to human resources. Rachel fears for her job but Tag is able to cover by claiming that he wrote the review himself as a joke. Monica decides to make candy and leave it outside her door as a way to meet the neighbors. The candy is a huge hit and people start dropping by at all hours to get more. Eventually Chandler convinces her that she\'s trying to buy the friendship of the neighbors and it\'s not working since they love the candy but don\'t even know her name.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Holiday Armadillo', 7, 10, 'Yes', 'Yes', 'No', 14, 12, 2000, 'Ross\'s plans to teach Ben about Hanukkah are continually thwarted when the young boy can\'t get his mind off of Santa. Phoebe prepares to move back into her refurbished apartment, with or without Rachel. However, she\'ll stop at nothing to get Rachel to go with her, including buying Joey a drum set. Monica is mystified by Chandler\'s inability to tip properly.', 'Y', 'N', 8.6),
	('Friends', 'The One With All The Cheesecakes', 7, 11, 'Yes', 'Yes', 'No', 4, 1, 2001, 'Phoebe gets angry with Joey when he blows off dinner with her for a date. The tables are turned however when her scientist boyfriend David returns to town for one night--the same night when she\'s scheduled to go to dinner with Joey. Monica is upset by her lack of invitation to a cousin\'s wedding, especially when she finds out that Ross was invited \'with guest\'. She convinces Ross to take her as his guest, only to find that the cousin had a good reason to not invite her--she had previously slept with the groom. Chandler accidentally gets a cheesecake delivered that was intended for another apartment. When he and Rachel start eating it, they are unable to stop and refuse to give it back. In fact, the cheesecake is so good, they take the replacement delivery as well.', 'Y', 'N', 8.6),
	('Friends', 'The One Where They\'re Up All Night', 7, 12, 'Yes', 'Yes', 'No', 11, 1, 2001, 'Ross assembles the gang on the roof to watch a meteor shower. They all decide to leave, however. Ross becomes trapped on the roof with Joey; the two try to escape using the fire escape. Rachel and Tag argue over which one of them forgot to send a package at work. Phoebe\'s fire alarm won\'t stop beeping. Chandler and Monica can\'t seem to fall asleep together, so they keep waking each other up.', 'Y', 'N', 8.7),
	('Friends', 'The One Where Rosita Dies', 7, 13, 'Yes', 'Yes', 'No', 1, 2, 2001, 'In an attempt to make up for her slow massage business, Phoebe takes a job as a telemarketer for an office supply company. When her first call is to a despondent office manager, she takes it upon herself to convince him to not kill himself. Monica and Ross discover that their parents are selling their house. When they go to collect their stuff, they find that Mr. Gellar used Monica\'s boxes to stop flood water from getting to his Porche and all her things are ruined. While attempting to re-arrange the furniture, Rachel breaks Joey\'s favorite chair (that he\'s named Rosita).', 'Y', 'N', 8.5),
	('Friends', 'The One Where They All Turn Thirty', 7, 14, 'Yes', 'Yes', 'No', 8, 2, 2001, 'When Rachel turns 30, the gang reminisces about their 30th birthdays. While trying to patch things up with Ursula, Phoebe discovers that she is 31. Ross buys a sports car to look cool. Monica gets drunk in front of her parents. Rachel breaks up with Tag because she is looking for commitment, while he is not.', 'Y', 'N', 8.6),
	('Friends', 'The One With Joey\'s New Brain', 7, 15, 'Yes', 'Yes', 'No', 15, 2, 2001, 'Ross plans a surprise for Monica and Chandler\'s wedding--he wants to play the bagpipes. Drake Ramoray is coming out of his coma on Days of Our Lives. A diva will be killed off and her character\'s brain will be transplanted into Drake\'s. Joey and the diva hook up. Phoebe and Rachel fight over a guy who left his cell phone in Central Perk.', 'Y', 'N', 8.5),
	('Friends', 'The One With The Truth About London', 7, 16, 'Yes', 'Yes', 'No', 22, 2, 2001, 'Chandler becomes upset after learning that Monica only came to his room in London looking for Joey on the first night they were together. Joey is ordained as a minister through the Internet so that he can officiate the wedding. Phoebe becomes upset after taking headache medicine. Ross becomes upset after a baby-sitting Rachel teaches Ben how to play pranks.', 'Y', 'N', 8.7),
	('Friends', 'The One With The Cheap Wedding Dress', 7, 17, 'Yes', 'Yes', 'No', 15, 3, 2001, 'Monica regrets telling a woman about a discount bridal shop when they end up fighting over the same dress. Meanwhile, Joey and Ross discover that they\'re dating the same girl.', 'Y', 'N', 8.5),
	('Friends', 'The One With Joey\'s Award', 7, 18, 'Yes', 'Yes', 'No', 29, 3, 2001, 'Joey is nominated for a Soapie Award, and will go to any length to get the award. He loses, but he steals a trophy from one of his co-stars (Jessica) who doesn\'t appreciate the award. Rachel, Phoebe, and Joey practice receiving awards. One of Ross\'s students convinces him that he failed his midterm because he\'s in love with Ross. When a guy hits on Phoebe instead of her, Monica realises that Chandler is the only one left in her life to kiss, sleep with, and so on.', 'Y', 'N', 8.5),
	('Friends', 'The One With Ross And Monica\'s Cousin', 7, 19, 'Yes', 'Yes', 'No', 19, 4, 2001, 'Joey auditions for a big movie role which will require him to appear naked. A problem arises, however, when the part calls for an uncircumcised man. Rachel and Phoebe plan Monica\'s wedding shower at the last minute. Ross and Monica\'s cousin visits and Ross becomes attracted to her for some reason.', 'Y', 'N', 8.8),
	('Friends', 'The One With Rachel\'s Big Kiss', 7, 20, 'Yes', 'Yes', 'No', 26, 4, 2001, 'Rachel\'s friend, Melissa, from college shows up at the coffee house which brings back memories of their \'closer\' days. Then when Melissa can\'t remember that special night in their senior year, Rachel goes to great lengths to prove to Phoebe that there was really a kiss. Meanwhile, Chandler and Ross argue for possession of Val Kilmer\'s tuxedo. Also, Joey drives Monica crazy when he insists that the wedding be arranged around his parents\' schedule.', 'Y', 'N', 8.5),
	('Friends', 'The One With The Vows', 7, 21, 'Yes', 'Yes', 'No', 3, 5, 2001, 'With four weeks left before the wedding, Chandler and Monica are faced with the issue of their wedding vows. With each person dealing with their own problems in writing the vows, they turn to memories of past events to help them. In the end, the only real problem is who will be saying the vows first.', 'Y', 'N', 7.6),
	('Friends', 'The One With Chandler\'s Dad', 7, 22, 'Yes', 'Yes', 'No', 10, 5, 2001, 'Monica\'s Porsche shows up again, and becomes a conflict when Rachel finds out she is the only one who hasn\'t driven it. Meanwhile, Chandler and Monica go off to Vegas to find Chandler\'s dad and invite him (or her) to the wedding. Back at home, Joey proves his masculinity to Phoebe, while Ross and Rachel hit the freeway in the \'bad boy\'.', 'Y', 'N', 8.5),
	('Friends', 'The One With Monica And Chandler\'s Wedding - 1', 7, 23, 'Yes', 'Yes', 'No', 17, 5, 2001, 'Monica and Chandler prepare for their wedding. During the rehearsal dinner with their families gather the night before for the rehearsal, Chandler\'s tie get\'s tighter and tighter until he can\'t take it anymore and he disappears. Meanwhile, Joey is starring in a movie with a prestigious actor with a spitting problem.', 'Y', 'N', 8.9),
	('Friends', 'The One With Monica And Chandler\'s Wedding - 2', 7, 24, 'Yes', 'Yes', 'No', 17, 5, 2001, 'Joey encounters problems trying to get off the movie set to officiate the wedding when the star turns up drunk. Meanwhile, Ross desperately searches for the missing Chandler as Rachel and Phoebe try to keep Monica from finding out. While the girls are searching, they come across a positive pregnancy test in a garbage can which they assume is Monica\'s. However, it turns out that it may actually belong to Rachel...', 'Y', 'N', 9.1),
	('Friends', 'The One After \'I Do\'', 8, 1, 'Yes', 'Yes', 'No', 27, 9, 2001, 'The excitement of Monica and Chandler\'s wedding is diminished by the news that someone may be pregnant. Chandler\'s hopes of not embarrassing Monica on the dance floor are ruined by his slippery new shoes, and Ross\' attempts to flirt with an attractive wedding guest.', 'Y', 'N', 8.7),
	('Friends', 'The One With The Red Sweater', 8, 2, 'Yes', 'Yes', 'No', 4, 10, 2001, 'Speculation regarding the father of Rachel\'s baby leads to a misunderstanding when Joey discovers a red sweater left behind in a one-night stand Rachel had. Meanwhile, Chandler and Ross search for the disposable cameras left behind at the wedding and Monica goes on an opening-present binge.', 'Y', 'N', 9),
	('Friends', 'The One Where Rachel Tells...', 8, 3, 'Yes', 'Yes', 'No', 11, 10, 2001, 'Chandler and Monica prepare to leave for their honeymoon as Rachel prepares to tell Ross that he\'s the father of her baby. Joey and Phoebe scheme to get inside the newlyweds\' apartment after discovering that they don\'t have a key. Monica and Chandler become jealous of another honeymooning couple who get bumped to first class on the airplane.', 'Y', 'N', 8.7),
	('Friends', 'The One With The Videotape', 8, 4, 'Yes', 'Yes', 'No', 18, 10, 2001, 'Monica and Chandler return from their honeymoon with stories of a couple that they met on the flight back, but soon discover that the couple gave them a wrong number. Ross and Rachel disagree over who came onto whom when they hooked up. He wants to prove it and accidentally reveals that he has the encounter on videotape.', 'Y', 'N', 9.3),
	('Friends', 'The One With Rachel\'s Date', 8, 5, 'Yes', 'Yes', 'No', 25, 10, 2001, 'Phoebe begins dating a guy who works for Monica, causing a problem when Phoebe wants to dump him on the same day Monica plans to fire him. Ross discovers that a coworker of Chandler\'s has been calling him Toby for five years. Joey sets Rachel up on a date with one of his co-stars. Ross worries about this and the fact that he doesn\'t see a future with Rachel anymore.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Halloween Party', 8, 6, 'Yes', 'Yes', 'No', 1, 11, 2001, 'Monica and Chandler decide to throw a costumed Halloween party. Phoebe runs into Ursula, who\'s getting married next week, and invites her and her fiance to the party.', 'Y', 'N', 8.6),
	('Friends', 'The One With The Stain', 8, 7, 'Yes', 'Yes', 'No', 8, 11, 2001, 'Chandler hires a maid, whom Monica suspects is stealing her clothing. Eric has broken up with Ursula and is ready to date Phoebe, except for one problem: he can\'t look at her without seeing Ursula. Ross tries to get Rachel an apartment in his building, but the woman living there isn\'t in a hurry to die, and Joey wants Rachel to stay with him.', 'Y', 'N', 8.1),
	('Friends', 'The One With The Stripper', 8, 8, 'Yes', 'Yes', 'No', 15, 11, 2001, 'Rachel prepares to have dinner with her dad and tell him that she\'s pregnant. Meanwhile, an unknowing Chandler discovers that Monica had a stripper at her bachelorette party, causing her to try to make it up, by getting him a stripper.', 'Y', 'N', 8.9),
	('Friends', 'The One With The Rumor', 8, 9, 'Yes', 'Yes', 'No', 22, 11, 2001, 'Monica invites an old friend from high school over for Thanksgiving dinner, unaware that Will started a \'We Hate Rachel\' club with Ross. Meanwhile, Joey vows to eat an entire turkey by himself, and Chandler and Phoebe pretend to watch football to avoid helping in the kitchen.', 'Y', 'N', 9.4),
	('Friends', 'The One With Monica\'s Boots', 8, 10, 'Yes', 'Yes', 'No', 6, 12, 2001, 'Chandler is peeved when Monica splurges on an expensive pair of boots. Phoebe learns Ross\' and Sting\'s children attend the same school, she angles to meet the celebrity and get concert tickets. When Joey\'s sister Dina tells him she is pregnant, he freaks out and goes to find the father to marry them. Rachel tries to calm him down.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Creepy Holiday Card', 8, 11, 'Yes', 'Yes', 'No', 13, 12, 2001, 'Ross starts to panic when Mona gets an idea to send out a holiday card for the two of them, thinking that their relationship is starting to move too fast. Chandler\'s newly divorced boss tries to get Monica and Chandler to come out to dinner with him, but Monica can\'t stand him. Rachel\'s hormones start acting up due to her pregnancy, causing her to hit on almost every guy she meets.', 'Y', 'N', 8.2),
	('Friends', 'The One Where Joey Dates Rachel', 8, 12, 'Yes', 'Yes', 'No', 10, 1, 2002, 'Phoebe gets Monica and Chandler a Ms. Pacman arcade game for a wedding present, which leads to some heavy competition between Monica, Phoebe, and, surprisingly, Chandler. Ross gets to teach an important class because of a retiring professor, but soon learns that its on the other side of town, and he doesn\'t have enough time to get there. Joey takes Rachel to dinner on a pretend date to make her feel better since she can\'t have a normal relationship due to her pregnancy.', 'Y', 'N', 8.6),
	('Friends', 'The One Where Chandler Takes A Bath', 8, 13, 'Yes', 'Yes', 'No', 17, 1, 2002, 'Monica turns Chandler on to the concept of a bath to relax, complete with scented oils and candles. Ross and Rachel toss baby names back and forth while deciding whether to learn the baby\'s sex. Joey still likes Rachel, a fact that Monica, Chandler and Phoebe discover by a little detective work.', 'Y', 'N', 8.6),
	('Friends', 'The One With The Secret Closet', 8, 14, 'Yes', 'Yes', 'No', 31, 1, 2002, 'Phoebe talks Monica into letting her give her a massage but becomes disconcerted when Monica begins making sexual noises. Joey dreams about being with Rachel and betraying Ross. Chandler realizes he\'s never seen what\'s in the closet by the bathroom and tries to break in. Rachel feels her baby kick for the first time.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Birthing Video', 8, 15, 'Yes', 'Yes', 'No', 7, 2, 2002, 'Phoebe tries to cheer up a depressed Joey by lending him the world\'s happiest dog. Ross has yet to tell Mona that Rachel\'s living with him. Monica and Chandler\'s romantic Valentine\'s Day is interrupted when they watch a videotape of Phoebe\'s friend giving birth. After being dumped by Mona, Ross gives Joey advice on his love life, helpful until Joey reveals that he\'s in love with Rachel.', 'Y', 'N', 8.4),
	('Friends', 'The One Where Joey Tells Rachel', 8, 16, 'Yes', 'Yes', 'No', 28, 2, 2002, 'Ross has trouble understanding Joey\'s revelation, as does Gunther. However, he comes to his senses and convinces Joey to tell Rachel how he feels. Joey takes her out to dinner and tells her, as she thinks it\'s a joke. She doesn\'t feel the same way, but they pledge to remain friends. Meanwhile, Phoebe meets Monica\'s soulmate.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Tea Leaves', 8, 17, 'Yes', 'Yes', 'No', 7, 3, 2002, 'Joey has been hiding from Rachel, so she invents a problem at work (My boss wants to buy my baby!) to draw him into conversation. Phoebe\'s tea leaves tell her that she\'s going to meet the man of her dreams, except that the man she meets is a nightmare. Later on though, she does meet a nice guy. Ross tries to retrieve his favorite shirt from Mona\'s, interrupted when she returns home with a date.', 'Y', 'N', 8.2),
	('Friends', 'The One In Massapequa', 8, 18, 'Yes', 'Yes', 'No', 28, 3, 2002, 'Everybody prepares to go out to Long Island for the elder Gellers\' 35th wedding anniversary party. Monica wants to write a toast to make everybody cry like Ross\'s toasts do. Ross and Rachel discover that his parents have told people they\'re married. Ross describes how he would propose to Rachel, and she seems intrigued. Phoebe invites her new boyfriend, Parker, who is extremely enthusiastic.', 'Y', 'N', 8.3),
	('Friends', 'The One With Joey\'s Interview', 8, 19, 'Yes', 'Yes', 'No', 4, 4, 2002, 'Joey prepares for an interview with Soap Opera Digest, although he\'s afraid of appearing stupid, so he enlists his friends to make sure things go well. During the interview, he reminisces about his past acting experiences, what he does in his spare time, eating and exercising right, his friends, his homosexual tendencies, and his romantic life.', 'Y', 'N', 7.7),
	('Friends', 'The One With The Baby Shower', 8, 20, 'Yes', 'Yes', 'No', 25, 4, 2002, 'Rachel panics when she realizes that she is not ready to take care of her baby, and reluctantly agrees for her mother to move in with her and Ross to help out. Monica tries desperately to get Mrs. Green to like her. Meanwhile, the guys help Joey practice for his audition as the host of a wild game show called \'Bamboozled.\'', 'Y', 'N', 8.3),
	('Friends', 'The One With The Cooking Class', 8, 21, 'Yes', 'Yes', 'No', 2, 5, 2002, 'Monica\'s restaurant gets a bad review in the Post. After confronting the critic who wrote it, she decides to join a cooking class, with Joey in tow. Ross goes on a date with a clerk from a baby store, making Rachel jealous. Chandler prepares for a job interview after Phoebe tells him that he makes a bad first impression.', 'Y', 'N', 8.3),
	('Friends', 'The One Where Rachel Is Late', 8, 22, 'Yes', 'Yes', 'No', 9, 5, 2002, 'With the release of Joey\'s movie approaching, he must decide which friend to invite to the premiere. Unfortunately, his pick, Chandler, falls asleep during it. Monica and Phoebe bet on when the baby will be born as Rachel\'s due date comes and goes. The doctor tells Ross and Rachel that sex may help speed things along. Just as they start to do it, Rachel\'s water breaks.', 'Y', 'N', 8.4),
	('Friends', 'The One Where Rachel Has A Baby - 1', 8, 23, 'Yes', 'Yes', 'No', 16, 5, 2002, 'Rachel and Ross arrive at the hospital; she\'s upset to get a semi-private room. Monica and Chandler decide to have a baby and right away. Mrs. Geller turns up to give Ross her mother\'s engagement ring; she wants Ross to marry Rachel. Joey can\'t understand why somebody wouldn\'t want to be married to Rachel. Phoebe meets a handsome stranger, but can\'t quite get his room number, so she gets Dr. Drake Ramoray to get it. She also gets him to find out some personal info from the guy. As Rachel waits for her own baby, various other pregnant women come and go, until Janice shows up.', 'Y', 'N', 8.8),
	('Friends', 'The One Where Rachel Has A Baby - 2', 8, 24, 'Yes', 'Yes', 'No', 16, 5, 2002, 'Drake reports to Phoebe. Chandler and Monica look for a room in the hospital to use for a tryst. After 21 hours of labor, Rachel\'s ready to have the baby. Joey blows it for Phoebe but fixes it just as quickly. The baby is in breach, but comes out okay. After Ross and Rachel kiss, the baby is named Emma Geller Green. Monica and Chandler find a janitor\'s closet. Janice convinces Rachel that she needs a guy who will be around. Ross still isn\'t interested, but Phoebe talks him into it. Joey finds the engagement ring. Rachel thinks he\'s proposing and says yes, as Ross walks down the hall with flowers.', 'Y', 'N', 9),
	('Friends', 'The One Where No One Proposes', 9, 1, 'Yes', 'Yes', 'No', 26, 9, 2002, 'Following Rachel\'s acceptance of Joey\'s accidental proposal, confusion reigns as Rachel wonders whether it was the right thing to do and Phoebe can\'t seem to mind her own business. Finally, Rachel, Ross and Joey get together in a room and figure out that no one was actually going to propose. Mr. Geller walks in on Monica and Chandler doing it in a closet. Joey tries to avoid watching Rachel breastfeed.', 'Y', 'N', 8.6),
	('Friends', 'The One Where Emma Cries', 9, 2, 'Yes', 'Yes', 'No', 3, 10, 2002, 'Chandler, having trouble getting enough sleep at home, falls asleep in a meeting and accidentally agrees to run his company\'s Tulsa office. Emma won\'t stop crying after Rachel interrupts her nap; Monica and Phoebe try to help get her back to sleep. Ross is still mad at Joey, and breaks his finger trying to punch him.', 'Y', 'N', 8.5),
	('Friends', 'The One With The Pediatrician', 9, 3, 'Yes', 'Yes', 'No', 10, 10, 2002, 'Rachel\'s pediatrician drops her as a client because she calls him incessantly (she thinks hiccups is emergency enough for 3AM)- so now she must find a new one. Chandler and Monica discuss Tulsa.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Sharks', 9, 4, 'Yes', 'Yes', 'No', 17, 10, 2002, 'Phoebe has a talk with Ross that prompts her to realize that she\'s never had a long term relationship. Monica makes a startling discovery while visiting Chandler in Tulsa. Joey\'s date\'s apartment seems really familiar, although he doesn\'t remember sleeping with her before.', 'Y', 'N', 8.3),
	('Friends', 'The One With Phoebe\'s Birthday Dinner', 9, 5, 'Yes', 'Yes', 'No', 31, 10, 2002, 'The friends are looking forward to getting together to celebrate Phoebe\'s birthday as it will be a rare opportunity for them to all be together. Monica plans to sleep with Chandler when he arrives since she\'s ovulating but the two fight when she learns he was smoking. Rachel is worried about leaving Emma with Ross\'s mother. When Mrs. Geller is late, Ross accidentally locks himself and Rachel out of the apartment with Emma inside. All this leaves Phoebe and Joey alone with a table for six.', 'Y', 'N', 8.5),
	('Friends', 'The One With The Male Nanny', 9, 6, 'Yes', 'Yes', 'No', 7, 11, 2002, 'Ross mocks Rachel\'s new male nanny. Chandler becomes upset when Monica says that somebody from her job is the funniest guy she\'s ever met. Phoebe and Mike exchange apartment keys, only to get a surprise visit from Phoebe\'s ex-boyfriend David.', 'Y', 'N', 8.5),
	('Friends', 'The One With Ross\'s Inappropriate Song', 9, 7, 'Yes', 'Yes', 'No', 14, 11, 2002, 'Ross makes Emma laugh by singing Sir Mix-A-Lot\'s \'Baby Got Back.\' Joey and Chandler, viewing Richard\'s old apartment, discover what they think is a tape of Richard having sex with Monica. Phoebe goes to dinner with Mike and his parents, where they encourage him to date somebody else. He tells them he loves Phoebe though.', 'Y', 'N', 8.7),
	('Friends', 'The One With Rachel\'s Other Sister', 9, 8, 'Yes', 'Yes', 'No', 21, 11, 2002, 'Rachel\'s sister Amy tags along for Thanksgiving at Monica\'s place, because her (married) boyfriend cancels their plans. While watching the parade, Joey realizes that he forgot to show up for the Days of Our Lives cast float, and he asks Phoebe how to lie to his boss so he won\'t get in trouble. Monica obsesses about anybody damaging her best china. Amy, who is self-absorbed and can\'t remember anybody\'s correct names, thinks that if Rachel and Ross die, she will then get custody of Emma, but Rachel and Ross tell her that Monica and Chandler are going to get Emma. Arguments ensue, and Chandler tries to prove that he would be a good parent, even if Monica weren\'t around.', 'Y', 'N', 8.8),
	('Friends', 'The One With Rachel\'s Phone Number', 9, 9, 'Yes', 'Yes', 'No', 5, 12, 2002, 'Joey becomes convinced that Monica\'s having an affair after Chandler sneaks back into town. Rachel gives her phone number to a guy at a bar. Ross and Mike try to hang out together but it doesn\'t go very well.', 'Y', 'N', 8.2),
	('Friends', 'The One With Christmas In Tulsa', 9, 10, 'Yes', 'Yes', 'No', 12, 12, 2002, 'While Chandler is stuck in Tulsa for Christmas, one of his co-workers comes onto him. A jealous Monica waits back in New York. Chandler decides to quit his job.', 'Y', 'N', 7.7),
	('Friends', 'The One Where Rachel Goes Back To Work', 9, 11, 'Yes', 'Yes', 'No', 9, 1, 2003, 'Rachel visits work and finds out that a guy named Gavin has been \'temporarily\' assigned to take over her job, and she becomes desperate to get back to work right away for fear they\'ll dump her. Gavin turns out to be a nice guy and offers to take care of Emma while Rachel gives her presentation. Meanwhile, Joey has to deal with Phoebe acting like...well, Phoebe, when he gets her a job as an extra on her soap, and Chandler and Monica deal with the fact Chandler doesn\'t have a job and now might not be the right time to start a family.', 'Y', 'N', 8.1),
	('Friends', 'The One With Phoebe\'s Rats', 9, 12, 'Yes', 'Yes', 'No', 16, 1, 2003, 'Gavin gives Rachel a very interesting birthday gift while Ross begs Joey to stay away from Emma\'s hot new nanny. Meanwhile, Mike meets and then accidentally murders Phoebe\'s unusual pet.', 'Y', 'N', 8.1),
	('Friends', 'The One Where Monica Sings', 9, 13, 'Yes', 'Yes', 'No', 30, 1, 2003, 'A night at Mike\'s piano bar gives Monica a very showy moment in the spotlight. Ross works on trying to move on after he witnesses Rachel and Gavin\'s kiss. Meanwhile, Chandler employs his secret skill to repair Joey\'s botched eyebrow-waxing job.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Blind Dates', 9, 14, 'Yes', 'Yes', 'No', 6, 2, 2003, 'Joey and Phoebe conspire to set up Rachel and Ross on their worst blind dates ever, hers being a pitiful lug, as they hope to reunite them out of mutual appreciation for what they had together. Meanwhile, while babysitting Emma, an ovulating Monica wants to become romantically intimate with Chandler but their privacy is compromised because they can\'t leave the infant alone or she\'ll scream bloody murder.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Mugging', 9, 15, 'Yes', 'Yes', 'No', 13, 2, 2003, 'Joey endures a draining audition at the hands of a pompous actor-director. Ross and Phoebe discover a secret link after being mugged together on the street. Chandler\'s advertising internship gets off to an impressive start.', 'Y', 'N', 8.5),
	('Friends', 'The One With The Boob Job', 9, 16, 'Yes', 'Yes', 'No', 20, 2, 2003, 'When Monica and Chandler are financially strapped, she secretly asks Joey for a large loan. When an unsuspecting Chandler also approaches his pal for some cash, Joey accidentally betrays Monica\'s confidence and then freaks out Chandler when he covers by saying she wants the money for a breast enhancement. Meanwhile, Phoebe asks Mike to move in with her, but changes her mind after a disagreement about marriage. Rachel\'s attempt to baby-proof the apartment tampers with a frustrated Joey\'s sanity.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Memorial Service', 9, 17, 'Yes', 'Yes', 'No', 13, 3, 2003, 'Chandler\'s jokey entry on his and Ross\'s college website leads to a faux burial service for the allegedly dead and obviously unpopular Gellar. Joey refuses to give Emma his favorite stuffed animal. Phoebe begs Monica to help her avoid a post-breakup tryst with Mike.', 'Y', 'N', 8.6),
	('Friends', 'The One With The Lottery', 9, 18, 'Yes', 'Yes', 'No', 3, 4, 2003, 'Monica leads the gang, except for a scoffing Ross, to purchase a bunch of lottery tickets for the multimillion-dollar powerball jackpot, but while they gleefully plot how to spend their possible shares, a disdainful Phoebe throws caution to the wind. Meanwhile, Chandler frets as he waits for a phone call that could mean a new paying job and Rachel thinks baby Emma is close to saying her first word.', 'Y', 'N', 8.6),
	('Friends', 'The One With Rachel\'s Dream', 9, 19, 'Yes', 'Yes', 'No', 17, 4, 2003, 'Rachel dreams about a romantic encounter with Joey after a visit to the set of \'Days of Our Lives\'. Chandler buys a non-refundable weekend getaway for himself and Monica, but when she can\'t get time off at work, Ross joins him. Meanwhile, Phoebe drives people away from Monica\'s restaurant with her terrible guitar playing.', 'Y', 'N', 8.2),
	('Friends', 'The One With The Soap Opera Party', 9, 20, 'Yes', 'Yes', 'No', 24, 4, 2003, 'Joey doesn\'t tell the gang about his plans to throw a party on the roof of the building. He also hides the fact that he\'s invited the \'Days of Our Lives\' cast, since the girls embarrass him when they meet stars. Rachel discovers the truth about the party and soon, everybody knows (except for Chandler). Ross meets a new colleague and, instantly attracted to her, invites her to the party. Rachel and Monica go the party and act like crazed fans while Ross is intimidated by Charlie\'s former boyfriends. Meanwhile, Chandler is at a play alone. At the end of the party, Rachel is looking for Joey and Ross is looking for Charlie, and they find Joey and Charlie kissing.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Fertility Test', 9, 21, 'Yes', 'Yes', 'No', 1, 5, 2003, 'Chandler and Monica court embarrassment when they secretly go to a fertility clinic for tests that will determine their family plans, until an old acquaintance runs into them. Ross hides his feelings for Charlie to help Joey woo her. Rachel sneaks into a spa for a massage and hopes that Phoebe won\'t find out and feel betrayed.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Donor', 9, 22, 'Yes', 'Yes', 'No', 8, 5, 2003, 'When Monica and Chandler learn of their chances for natural conception, they resort to interviewing unsuspecting male candidates to find the perfect match for one who could inseminate her. Elsewhere, Phoebe is incredibly nervous about going to a party that Mike will be at--until she bumps into David. Meanwhile, Rachel finds herself being mean to Charlie because of their common romantic interest in Joey, and Ross works hard on a lecture he hopes to present at a paleontology convention in Barbados.', 'Y', 'N', 7.9),
	('Friends', 'The One In Barbados - 1', 9, 23, 'Yes', 'Yes', 'No', 15, 5, 2003, 'Chandler gives David advice that culminates in David deciding to propose to Phoebe. However, Phoebe is still in love with Mike. Monica meddles and calls Mike, who shows up in Barbados and interrupts David\'s marriage proposal with one of his own. Phoebe chooses Mike, although she doesn\'t accept his proposal. Meanwhile, sparks fly between Ross and Charlie when they spend some time together rewriting his speech, and Rachel struggles with the idea of telling Joey that she\'s crazy about him.', 'Y', 'N', 8.5),
	('Friends', 'The One In Barbados - 2', 9, 24, 'Yes', 'Yes', 'No', 15, 5, 2003, 'Charlie and Joey break up, and Rachel finally tells Joey about her crush on him. He decides nothing can happen because Ross is a good friend, but after he sees Ross and Charlie kissing, he heads back up to Rachel\'s room where the two kiss and shut the door. Meanwhile, Monica and Mike compete at a game of ping pong.', 'Y', 'N', 8.6),
	('Friends', 'The One After Joey And Rachel Kiss', 10, 1, 'Yes', 'Yes', 'No', 25, 9, 2003, 'Monica, Chandler and Phoebe discover that they can eavesdrop on Ross & Charlie and Joey & Rachel through the walls of the hotel. Both new couples decide to wait before proceeding with their relationships, until the men can talk to each other. Ross tells Joey on the plane ride back to New York, but Joey can\'t quite yet. Later, Ross walks in on Joey and Rachel kissing. Meanwhile, Monica combats her poofy hair by getting corn rows put in, and Phoebe discovers that Mike has a girlfriend.', 'Y', 'N', 8.5),
	('Friends', 'The One Where Ross Is Fine', 10, 2, 'Yes', 'Yes', 'No', 2, 10, 2003, 'Ross puts on a convincing front and invites Joey and Rachel to dine on fajitas with him and Charlie. He quickly gets drunk and embarrasses everyone. After Rachel and Charlie leave, Joey spends the night and the two talk in the morning. Ross tells Joey he\'ll work on getting used to him and Rachel. Meanwhile, Frank Jr. visits with his kids and tries to talk Phoebe into taking one of the triplets. Also, Chandler and Monica visit some friends of Phoebe\'s to learn about adoption. However, Chandler accidentally tells their son something he didn\'t know - that he\'s adopted.', 'Y', 'N', 8.8),
	('Friends', 'The One With Ross\'s Tan', 10, 3, 'Yes', 'Yes', 'No', 9, 10, 2003, 'Joey and Rachel\'s first date goes well, until they return to their apartment and discover that everything\'s awkward. They decide that they make better friends than lovers and call off their relationship. Monica and Phoebe try to avoid their annoying friend Amanda, who has returned from living in London with a fake British accent. Ross gets a spray-on tan.', 'Y', 'N', 8.8),
	('Friends', 'The One With The Cake', 10, 4, 'Yes', 'Yes', 'No', 23, 10, 2003, 'It\'s baby Emma\'s first birthday and Rachel won\'t let the party start until Emma wakes from her nap. However, everybody has places to be: Monica and Chandler want to leave for a weekend getaway in Vermont, Phoebe has a massage client, and Joey has an audition.', 'Y', 'N', 8.4),
	('Friends', 'The One Where Rachel\'s Sister Baby-Sits', 10, 5, 'Yes', 'Yes', 'No', 30, 10, 2003, 'Monica and Chandler solicit Joey to write a letter to the adoption agency on their behalf. Joey discovers the thesaurus. Rachel\'s sister Amy visits and moves in with Rachel and Joey. She babysits Emma and gets the little girl\'s ears pierced. On their first anniversary, Phoebe spoils Mike\'s plans to propose, so she proposes to him. That doesn\'t go well, but the two get engaged anyway.', 'Y', 'N', 8.3),
	('Friends', 'The One With Ross\'s Grant', 10, 6, 'Yes', 'Yes', 'No', 6, 11, 2003, 'Rachel and Monica fight over who will receive an ugly painting from Phoebe\'s apartment when Mike wants her to get rid of it. Chandler gets on Joey\'s bad side when he lies about watching Joey\'s audition tape. Ross is up for a big grant, although Charlie\'s ex-boyfriend is in charge of who gets it. Dr. Hobart tries to trade--Ross breaks up with Charlie and he\'ll get the grant. Eventually, Charlie and Dr. Hobart reconcile after he reveals his feelings for her.', 'Y', 'N', 8.3),
	('Friends', 'The One With The Home Study', 10, 7, 'Yes', 'Yes', 'No', 13, 11, 2003, 'Phoebe and Mike struggle over their decision to donate their wedding fund to charity. Ross discovers Rachel\'s irrational fear of swings. The adoption worker in charge of deciding the fate of Monica and Chandler\'s adoption hopes had a one-night-stand with Joey where he never called her back. Monica and Chandler are approved for adoption.', 'Y', 'N', 8.4),
	('Friends', 'The One With The Late Thanksgiving', 10, 8, 'Yes', 'Yes', 'No', 20, 11, 2003, 'After Monica announces that she\'s not cooking Thanksgiving dinner this year, Phoebe talks her back into it. Ross, Rachel, Phoebe and Joey are all late to the dinner, thanks to a baby beauty contest and a Rangers game, so Monica and Chandler lock them out. The gang is united again when Monica gets a phone call informing her that a pregnant girl from Ohio has selected her to adopt her unborn baby.', 'Y', 'N', 8.9),
	('Friends', 'The One With The Birth Mother', 10, 9, 'Yes', 'Yes', 'No', 8, 1, 2004, 'Monica and Chandler travel to Ohio to meet a potential mother for their child, but they\'re put in an uncomfortable situation when the mom-to-be thinks they\'re a reverend and doctor. Joey\'s date picks food off his plate. Rachel picks out an outfit for Ross to wear on a date, but accidentally gives him the bag with her purchases instead.', 'Y', 'N', 8.5),
	('Friends', 'The One Where Chandler Gets Caught', 10, 10, 'Yes', 'Yes', 'No', 15, 1, 2004, 'Phoebe and Rachel catch Chandler getting into a car with a blonde woman and think he\'s having an affair. It turns out that the woman was Monica and Chandler\'s realtor, and the two are buying a house in Westchester. The friends reminisce about their good times in the apartment.', 'Y', 'N', 8.1),
	('Friends', 'The One Where The Stripper Cries', 10, 11, 'Yes', 'Yes', 'No', 5, 2, 2004, 'Phoebe\'s bachelorette party features a rather unexpected surprise when the stripper shows up. Joey is on \'Pyramid\'. Chandler and Ross flash back to 1987 to reflect on a pact they made when they were in college.', 'Y', 'N', 9),
	('Friends', 'The One With Phoebe\'s Wedding', 10, 12, 'Yes', 'Yes', 'No', 12, 2, 2004, 'Phoebe asks Joey to give her away at her wedding. Monica\'s the wedding planner and she\'s driving Phoebe nuts. Chandler and Ross discover at the rehearsal dinner that neither of them has a part in the wedding. However, Mike needs to replace a groomsman, so he lets Phoebe choose one of them, although she gives the job to Rachel. Joey takes his role as the bride\'s dad way too seriously. Phoebe fires Monica. The day of the wedding, New York is hit with the worst snowstorm its seen in 20 years. Phoebe rehires Monica, and the wedding ends up taking place in the street outside of Central Perk. When the priest can\'t make it, Joey steps in for him, and Chandler gives the bride away, while groomsman Ross is stuck taking care of Mike\'s old dog.', 'Y', 'N', 8.9),
	('Friends', 'The One Where Joey Speaks French', 10, 13, 'Yes', 'Yes', 'No', 19, 2, 2004, 'Phoebe tries to teach Joey to speak French for an audition. Surrogate mom Erica is visiting town and tells the Bings that the baby\'s father may be a shovel killer. Ross and Rachel head out to Long Island after her dad has a heart attack. After Ross rejects an upset Rachel\'s advances, the two decide never to have sex again, although Rachel suggests it still might happen.', 'Y', 'N', 8.6),
	('Friends', 'The One With Princess Consuela', 10, 14, 'Yes', 'Yes', 'No', 26, 2, 2004, 'Monica and Chandler visit their house, which is in escrow, where Joey is comforted about losing his friends by the 8-year-old girl who presently lives there. Phoebe learns that she can change her name to whatever she wants, which turns out to be Princess Consuela Bananahammock. After Mike changes his name to Crap Bag, she decides to just be Phoebe Buffay-Hannigan. Ross gets tenure at his job. Rachel\'s boss is sitting next to her at an interview, and she loses her job. However, she runs into her old friend Mark, who offers her a job in Paris.', 'Y', 'N', 8.7),
	('Friends', 'The One Where Estelle Dies', 10, 15, 'Yes', 'Yes', 'No', 22, 4, 2004, 'Ross tries to get Rachel rehired at Ralph Lauren. He succeeds, but after Rachel tells him how scared she is about moving to Paris, he\'s convinced she should go. Phoebe discovers that Joey\'s agent Estelle died and, since his life has been changing so much recently, doesn\'t want to tell him. Chandler and Monica visit the house next door to theirs and discover that Janice is bidding on it. To get Janice to withdraw her offer, Chandler comes on to her.', 'Y', 'N', 8.6),
	('Friends', 'The One With Rachel\'s Going Away Party', 10, 16, 'Yes', 'Yes', 'No', 29, 4, 2004, 'With Rachel leaving tomorrow, the gang throws her a small going away party. She says goodbye to each of her friends individually, except for Ross. He gets mad and the two of them end up in a passionate kiss after she explains that she was putting it off because of how hard saying goodbye to him would be. Meanwhile, Erica is in town until the baby arrives and she ends up going into labor at the party.', 'Y', 'N', 8.9),
	('Friends', 'The Last One - 1', 10, 17, 'Yes', 'Yes', 'No', 6, 5, 2004, 'Ross and Phoebe chase Rachel to the airport, but end up at the wrong one. They narrowly make it to the right airport, where Ross declares his love for Rachel, but she gets on the plane anyway. A rejected Ross returns home, where he finds a message on his answering machine, revealing that Rachel got off the plane, just as the real thing shows up behind him. They decide to be together. Meanwhile, Chandler and Monica finish packing for their move to the suburbs, and Joey loses Chick Jr. and Duck Jr. in the foosball table.', 'Y', 'N', 9.5),
	('Friends', 'The Last One - 2', 10, 18, 'Yes', 'Yes', 'No', 6, 5, 2004, 'Ross and Phoebe chase Rachel to the airport, but end up at the wrong one. They narrowly make it to the right airport, where Ross declares his love for Rachel, but she gets on the plane anyway. A rejected Ross returns home, where he finds a message on his answering machine, revealing that Rachel got off the plane, just as the real thing shows up behind him. They decide to be together. Meanwhile, Chandler and Monica finish packing for their move to the suburbs, and Joey loses Chick Jr. and Duck Jr. in the foosball table.', 'Y', 'N', 9.7),
	('Game Of Thrones', 'Winter Is Coming', 1, 1, 'Yes', 'Yes', 'Yes', 17, 4, 2011, 'Ned Stark, Lord of Winterfell learns that his mentor, Jon Arryn, has died and that King Robert is on his way north to offer Ned Arryns position as the Kings Hand. Across the Narrow Sea in Pentos, Viserys Targaryen plans to wed his sister Daenerys to the nomadic Dothraki warrior leader, Khal Drogo to forge an alliance to take the throne.', 'Y', 'N', 8.9),
	('Game Of Thrones', 'The Kingsroad', 1, 2, 'Yes', 'Yes', 'Yes', 24, 4, 2011, 'Having agreed to become the Kings Hand, Ned leaves Winterfell with daughters Sansa and Arya, while Catelyn stays behind in Winterfell. Jon Snow heads north to join the brotherhood of the Nights Watch. Tyrion decides to forego the trip south with his family, instead joining Jon in the entourage heading to the Wall. Viserys bides his time in hopes of winning back the throne, while Daenerys focuses her attention on learning how to please her new husband, Drogo.', 'Y', 'N', 8.7),
	('Game Of Thrones', 'Lord Snow', 1, 3, 'Yes', 'Yes', 'Yes', 1, 5, 2011, 'Arriving at Kings Landing, Ned is shocked to learn of the Crowns profligacy from his new advisors. At Castle Black, Jon Snow impresses Tyrion at the expense of greener recruits. Suspecting the Lannisters had a hand in Brans fall, Catelyn covertly follows her husband to Kings Landing, where she is intercepted by Petyr Baelish, a.k.a. Littlefinger, a shrewd longtime ally and brothel owner. Cersei and Jaime ponder the implications of Brans recovery; Arya studies swordsmanship. On the road to Vaes Dothrak, Daenerys finds herself at odds with Viserys.', 'Y', 'N', 8.6),
	('Game Of Thrones', 'Cripples, Bastards, And Broken Things', 1, 4, 'Yes', 'Yes', 'Yes', 8, 5, 2011, 'Ned looks for clues to the death of his predecessor, and uncovers one of King Roberts bastards. Robert and his guests witness a tournament honoring Ned. Jon takes measures to protect Sam from further abuse at Castle Black; a frustrated Viserys clashes with Daenerys in Vaes Dothrak; Sansa imagines her future as a queen, while Arya envisions a far different future. Catelyn rallies her husbands allies to make a point, while Tyrion finds himself caught in the wrong place at the wrong time.', 'Y', 'N', 8.7),
	('Game Of Thrones', 'The Wolf And The Lion', 1, 5, 'Yes', 'Yes', 'Yes', 15, 5, 2011, 'Incensed over news of Daenerys alliance with the Dothrakis, Robert orders a preemptive strike on the Targaryens that drives a wedge in his relationship with Ned. A captive Tyrion helps Catelyn, but receives a cold reception at the Eyrie from her sister, Jon Arryns widow Lysa. Sansa is charmed by the dashing Ser Loras Tyrell, a.k.a. the Knight of Flowers. Arya overhears a plot against her father.', 'Y', 'N', 9),
	('Game Of Thrones', 'A Golden Crown', 1, 6, 'Yes', 'Yes', 'Yes', 22, 5, 2011, 'Reinstated as the Hand, Ned sits for the King while Robert is on a hunt. Ned issues a decree that could have long-term consequences throughout the Seven Kingdoms. At the Eyrie, Tyrion confesses to his \'crimes\', and demands that Lysa give him a trial by combat. Joffrey apologizes to Sansa. Viserys receives his final payment for Daenerys from Drogo.', 'Y', 'N', 9.1),
	('Game Of Thrones', 'You Win Or You Die', 1, 7, 'Yes', 'Yes', 'Yes', 29, 5, 2011, 'Explaining that the future of the Lannisters is at stake, Tywin presses Jaime to be the man you were meant to be as they prepare for battle. Ned confronts Cersei about the secrets that killed Jon Arryn. With the fate of the missing Benjen very much on his mind, Jon takes his Nights Watch vows, though not with the assignment he coveted. After Ser Jorah saves Daenerys from treachery, an enraged Drogo vows to lead the Dothraki where theyve never gone before. An injured Robert takes pains to ensure an orderly transition at Kings Landing.', 'Y', 'N', 9.2),
	('Game Of Thrones', 'The Pointy End', 1, 8, 'Yes', 'Yes', 'Yes', 5, 6, 2011, 'In the aftermath of Ned\'s capture, Syrio and Arya face off against Lannister guards, while Cersei manipulates Sansa to her own ends. Robb rallies his father\'s northern allies against Tywin Lannister and heads south to war. Tyrion forms an uneasy alliance with the hill tribes and reunites with his father. Jon lashes out at Ser Alliser Thorne and battles a mysterious attacker from beyond the Wall. Dany is forced to reconcile her desire to conquer Westeros with Drogo\'s savagery after the Dothraki raid a peaceful village.', 'Y', 'N', 9),
	('Game Of Thrones', 'Baelor', 1, 9, 'Yes', 'Yes', 'Yes', 12, 6, 2011, 'With Sansa\'s life in danger, Ned makes a fateful decision. Catelyn brokers an unsavory deal with the slippery Walder Frey. Tyrion acquires a mistress and is forced by his father to fight on the front lines. Robb wins his first major victory and captures a prized prisoner. Jon is rewarded for his valor and discovers a dark secret about Maester Aemon. As Drogo\'s wound festers, Dany defies her bloodrider Qotho and puts her trust in the enslaved witch Mirri Maz Duur.', 'Y', 'N', 9.5),
	('Game Of Thrones', 'Fire And Blood', 1, 10, 'Yes', 'Yes', 'Yes', 19, 6, 2011, 'As tragic news spreads across the Seven Kingdoms, Bran and Rickon share a prophetic dream, Catelyn interrogates Jamie about her son\'s fall, and Robb\'s destiny is forever changed. After a surprising decision by his father, Tyrion heads south. Arya assumes a new identity in an attempt to escape King\'s Landing, and Sansa is terrorized by Joffrey. At the Wall, Jon is forced to choose between the Night\'s Watch and the family he left behind. Across the sea, Dany pays a terrible price for her love, but finds new hope.', 'Y', 'N', 9.4),
	('Game Of Thrones', 'The North Remembers', 2, 1, 'Yes', 'Yes', 'Yes', 1, 4, 2012, 'As Robb Stark and his northern army continue the war against the Lannisters, Tyrion arrives in Kings Landing to counsel Joffrey and temper the young kings excesses.  On the island of Dragonstone, Stannis Baratheon plots an invasion to claim his late brothers throne, allying himself with the fiery Melisandre, a strange priestess of a stranger god.  Across the sea, Daenerys, her three young dragons, and the khalasar trek through the Red Waste in search of allies, or water.  In the North, Bran presides over a threadbare Winterfell, while beyond the Wall, Jon Snow and the Nights Watch must shelter with a devious wildling.', 'Y', 'N', 8.8),
	('Game Of Thrones', 'The Night Lands', 2, 2, 'Yes', 'Yes', 'Yes', 8, 4, 2012, 'In the wake of a bloody purge in the capital, Tyrion chastens Cersei for alienating the kings subjects.  On the road north, Arya shares a secret with Gendry, a Nights Watch recruit.  With supplies dwindling, one of Danys scouts returns with news of their position.  After nine years as a Stark ward, Theon Greyjoy reunites with his father Balon, who wants to restore the ancient Kingdom of the Iron Islands.  Davos enlists Salladhor Saan, a pirate, to join forces with Stannis and Melisandre for a naval invasion of Kings Landing.', 'Y', 'N', 8.5),
	('Game Of Thrones', 'What Is Dead May Never Die', 2, 3, 'Yes', 'Yes', 'Yes', 15, 4, 2012, 'At the Red Keep, Tyrion plots three alliances through the promise of marriage.  Catelyn arrives in the Stormlands to forge an alliance of her own, but King Renly, his new wife Margaery, and her brother Loras Tyrell have other plans.  At Winterfell, Luwin tries to decipher Brans dreams.', 'Y', 'N', 8.8),
	('Game Of Thrones', 'Garden Of Bones', 2, 4, 'Yes', 'Yes', 'Yes', 22, 4, 2012, 'Joffrey punishes Sansa for Robbs victories, and Tyrion scrambles to temper the kings cruelty. Catelyn entreats Stannis and Renly to unite against the Lannisters. Dany and her khalasar arrive at the prosperous city of Qarth. Tyrion coerces a relative into being his eyes and ears. Arya and Gendry are taken to Harrenhal, where their lives are in the hands of Ser Gregor Clegane. Stannis orders Davos to smuggle Melisandre into a secret cove.', 'Y', 'N', 8.7),
	('Game Of Thrones', 'The Ghost Of Harrenhal', 2, 5, 'Yes', 'Yes', 'Yes', 29, 4, 2012, 'The Baratheon rivalry ends, driving Catelyn to flee and Littlefinger to act. At Kings Landing, Tyrions source alerts him to Joffreys defense plan - and a mysterious secret weapon. Theon sails to the Stony Shore to prove hes worthy to be called Ironborn. At Harrenhal, Arya receives a promise from Jaqen Hghar, one of the prisoners she saved from the Gold Cloaks. The Nights Watch arrive at the Fist of the First Men, an ancient ringfort where they hope to stem the wildings\' advance.', 'Y', 'N', 8.8),
	('Game Of Thrones', 'The Old Gods And The New', 2, 6, 'Yes', 'Yes', 'Yes', 6, 5, 2012, 'Theon completes his master stroke. In King\'s Landing, the Lannisters send Myrcella off to be married. Arya comes face to face with a surprise visitor. Dany vows to take what is hers. Robb and Catelyn receive crucial news. Qhorin gives Jon a chance to prove himself.', 'Y', 'N', 9),
