	('Game Of Thrones', 'Valar Morghulis', 2, 10, 'Yes', 'Yes', 'Yes', 3, 6, 2012, 'Tyrion awakens to a changed situation. King Joffrey doles out rewards to his subjects. As Theon stirs his men to action, Luwin offers some final advice. Brienne silences Jaime. Arya receives a gift from Jaqen. Dany goes to a strange place. Jon proves himself to Qhorin.', 'Y', 'N', 9.4),
	('Game Of Thrones', 'Valar Dohaeris', 3, 1, 'Yes', 'Yes', 'Yes', 31, 3, 2013, 'Jon meets the King-Beyond-the-Wall while his Night Watch Brothers flee south. In King\'s Landing, Tyrion wants a reward, Margaery shows her charitable nature, Cersei arranges a dinner party, and Littlefinger offers to help Sansa. Across the Narrow Sea, Daenerys starts her journey west.', 'Y', 'N', 8.7),
