	('Game Of Thrones', 'Walk Of Punishment', 3, 3, 'Yes', 'Yes', 'Yes', 14, 4, 2013, 'Tyrion shoulders new responsibilities. Jon is taken to the Fist of the First Men. Daenerys meets with the slavers. Jaime strikes a deal with his captors.', 'Y', 'N', 8.8),
