	('Game Of Thrones', 'The Bear And The Maiden Fair', 3, 7, 'Yes', 'Yes', 'Yes', 12, 5, 2013, 'Daenerys exchanges gifts with a slave lord outside of Yunkai. As Sansa frets about her prospects, Shae chafes at Tyrions new situation. Tywin counsels the king, and Melisandre reveals a secret to Gendry. Brienne faces a formidable foe in Harrenhal.', 'Y', 'N', 8.6),
	('Game Of Thrones', 'Second Sons', 3, 8, 'Yes', 'Yes', 'Yes', 19, 5, 2013, 'Kings Landing hosts a wedding, and Tyrion and Sansa spend the night together. Daenerys meets the Titans Bastard. Davos demands proof from Melisandre. Sam and Gilly meet an older gentleman.', 'Y', 'N', 8.9),
