	('Game Of Thrones', 'Mhysa', 3, 10, 'Yes', 'Yes', 'Yes', 9, 6, 2013, 'Joffrey challenges Tywin. Bran tells a ghost story. In Dragonstone, mercy comes from strange quarters. Daenerys waits to see if she is a conqueror or a liberator.', 'Y', 'N', 9),
	('Game Of Thrones', 'Two Swords', 4, 1, 'Yes', 'Yes', 'Yes', 6, 4, 2014, 'Tyrion welcomes a surprise guest to Kings Landing for the royal wedding, but fears hes come to the Red Keep for something else. Meanwhile, Jon warns his skeptical Nights Watch superiors about an impending attack. Jaime struggles to regain his status at home. Arya encounters a face from her past, and Daario Naharis discusses strategy with Daenerys on the journey to the slave city Meereen.', 'Y', 'N', 9.1),
	('Game Of Thrones', 'The Lion And The Rose', 4, 2, 'Yes', 'Yes', 'Yes', 13, 4, 2014, 'A whos who of honored guests turns out for Joffrey and Margaerys wedding in Kings Landing, but the kings taste in entertainment rubs many of them the wrong way. Meanwhile, Bronn gives a lesson to an unlikely pupil; Brans vision helps map out his journey; Stannis loses patience with Davos; and Ramsay takes a perverse delight in his new pet.', 'Y', 'N', 9.7),
	('Game Of Thrones', 'Breaker Of Chains', 4, 3, 'Yes', 'Yes', 'Yes', 20, 4, 2014, 'In the frenzied aftermath of the royal wedding, Tyrion gets a visit from a loyal subject, but wonders if anyone in his family will help him out of his current predicament. Meanwhile, Tywin offers to work for the common good with a presumed enemy. Sam takes stock of the personnel at Castle Black. The Hound gives another life lesson to Arya, and Daenerys makes a decision outside the walls of Meereen.', 'Y', 'N', 8.8),
