	('Happy Endings', 'The Shershow Redemption', 1, 12, 'Yes', 'Yes', 'No', 25, 5, 2011, 'An old friend gets married, and the bride thinks Alex is a jinx; Penny and Derrick pretend to be engaged.', 'N', 'N', 7.9),
	('Happy Endings', 'Why Can\'t You Read Me', 1, 13, 'Yes', 'Yes', 'No', 24, 8, 2011, 'Alex and Jane\'s sibling rivalry heats up. Dave dates an attractive woman (Bre Blair) with an unusual quirk. Penny gets an assistant', 'N', 'N', 7.7),
	('Happy Endings', 'Blax, Snake, Home', 2, 1, 'Yes', 'Yes', 'No', 28, 9, 2011, 'Alex and Dave to decide that they should be honest with each other. Penny buys a new condo and declares that it\'s \'The Year of Penny\', the year where everything will start going her way. Max tries to find out why Brad hasn\'t been hanging out with him lately.', 'N', 'N', 7.8),
	('Happy Endings', 'Baby Steps', 2, 2, 'Yes', 'Yes', 'No', 5, 10, 2011, 'Alex\'s new T-shirts intended for children end up being a hit with with teenagers. Jane searches for the child she believes was conceived from an egg she donated years ago. Max starts working at Dave\'s food truck.', 'N', 'N', 7.8),
	('Happy Endings', 'Yesandwitch', 2, 3, 'Yes', 'Yes', 'No', 12, 10, 2011, 'Penny\'s mom Dana visits, however, Penny learns that her mom\'s inspiring upbeat attitude is hiding some bad news, which leads Penny to decide to give her mom a reality check. Max plays tour guide to some tourists in his new limo with the help of Brad and Jane.', 'N', 'N', 7.5),
	('Happy Endings', 'Secrets And Limos', 2, 4, 'Yes', 'Yes', 'No', 19, 10, 2011, 'Jane convinces Penny to make a vision board to visualize the path to her dreams, although everything doesn\'t go according to plan. Brad finds it hard to relate to his stern boss until the guy sees Max\'s limo. Dave is reluctant to let the gang to meet his new girlfriend.', 'N', 'N', 7.5),
	('Happy Endings', 'Spooky Endings', 2, 5, 'Yes', 'Yes', 'No', 26, 10, 2011, 'Penny, Max, Dave and Alex head to a Halloween warehouse party, where their costumes don\'t have the effect they anticipated. Meanwhile, Jane and Brad spend their Halloween house sitting for some friends in the suburbs.', 'N', 'N', 8.1),
	('Happy Endings', 'Lying Around', 2, 6, 'Yes', 'Yes', 'No', 2, 11, 2011, 'Brad discovers that Jane\'s old sorority sister is coming for a visit, so he lies and says he has a work retreat out of town, when he\'s actually on \'staycation\' in a fancy hotel in the city. Penny becomes jealous when Alex dates her former boyfriend Liam, and Max and Dave make a commercial to promote the \'Steak Me Home Tonight\' food truck.', 'N', 'N', 7.6),
	('Happy Endings', 'The Code War', 2, 7, 'Yes', 'Yes', 'No', 16, 11, 2011, 'When Max\'s high school girlfriend Angie, the girl he dated before he realized he was gay, returns to town, Penny (who was Max\'s girlfriend in college) starts to feel jealous. Meanwhile, Alex starts to develop an unusual crush on Max. When Dave starts dating Angie, Max becomes angry and declares a \'code war\'. Jane finds out that Brad has a \'work wife\', so she sets out to obtain a \'work husband\'.', 'N', 'N', 7.9),
	('Happy Endings', 'Full Court Dress', 2, 8, 'Yes', 'Yes', 'No', 23, 11, 2011, 'Jane needs a dress to wear to her charity event, but she\'s a little leery when Alex offers to design one for her. Penny helps a panicked Max babysit his niece and nephew, and Dave and Brad\'s new friendship with their oddball mailman, Drew, isn\'t quite what they had hoped for.', 'N', 'N', 7.1),
	('Happy Endings', 'Grinches Be Crazy', 2, 9, 'Yes', 'Yes', 'No', 7, 12, 2011, 'Max agrees to dress up as Santa for Penny\'s charity event. Jane accidently gives housekeeper Gita the envelope stuffed with money for their big Xmas getaway to Turks & Caicos, instead of the $200 Christmas tip she had planned. Dave cashes in all the homemade coupons Alex gave him as gifts from past Christmases.', 'N', 'N', 7.5),
	('Happy Endings', 'The Shrink, The Dare, Her Date And Her Brother', 2, 10, 'Yes', 'Yes', 'No', 4, 1, 2012, 'Dave has a surprising reaction when his shrink starts dating Penny. Max and Jane\'s fight over a sweater leads to a strange competition, and Alex and Brad bond when they discover a shared interest.', 'N', 'N', 7.6),
	('Happy Endings', 'Meet The Parrots', 2, 11, 'Yes', 'Yes', 'No', 11, 1, 2012, 'Dave\'s father comes to town to introduce his new girlfriend, who turns out to be Penny\'s mother, Dana. Alex decides to adopt a pet parrot that turns out to be not so charming. Alex enlists Brad and Max\'s help, as she is convinced the Chinese restaurant next door is a front for a brothel.', 'N', 'N', 7.5),
	('Happy Endings', 'Makin\' Changes', 2, 12, 'Yes', 'Yes', 'No', 18, 1, 2012, 'Jane encourages Penny to find a man and then change him to suit her expectations. Alex stages an intervention to stop Dave from his obsession with V-neck shirts.', 'N', 'N', 7.7),
	('Happy Endings', 'The St. Valentine\'s Day Maxssacre', 2, 13, 'Yes', 'Yes', 'No', 8, 2, 2012, 'Penny has a new boyfriend she wants to dump and Dave is afraid his new girlfriend is about to dump him. Alex goes looking for a party in the sketchy part of town, and Brad\'s hopes for a perfect night out for Jane are dashed when a dental appointment goes terribly wrong. Max picks up a couple with his limo only to find that one of the passengers is Grant, the boyfriend he broke up with a year ago.', 'N', 'N', 8.2),
	('Happy Endings', 'Everybody Loves Grant', 2, 14, 'Yes', 'Yes', 'No', 15, 2, 2012, 'When the whole gang, with the exception of Dave, falls in love with Grant, Max wonders if he really is good enough to date the \'perfect\' guy. Meanwhile, Dave sets out to prove he\'s way cooler than Max\'s new boyfriend.', 'N', 'N', 7.7),
	('Happy Endings', 'The Butterfly Effect Effect', 2, 15, 'Yes', 'Yes', 'No', 22, 2, 2012, 'The friends wait for Brad and Jane\'s annual \'Spring Smackdown\', their yearly blowout of a domestic squabble, to let them know when Max will come out of hibernation and when winter will end.', 'N', 'N', 8),
	('Happy Endings', 'Cocktails & Dreams', 2, 16, 'Yes', 'Yes', 'No', 29, 2, 2012, 'Dave gets a liquor license for his food truck, making it a new hot spot. The gang avoids Dave because his signature drink gives them sex dreams about him.', 'N', 'N', 8),
	('Happy Endings', 'The Kerkovich Way', 2, 17, 'Yes', 'Yes', 'No', 7, 3, 2012, 'A panicked Alex enlists Jane\'s help in convincing Dave that something he\'s certain happened never did using \'The Kerkovich Way\', an ancient Serbian memory-wiping technique passed down through the Kerkovich clan. Meanwhile, Penny and Max are determined to finally beat an annoyingly perfect couple in the annual Rosalita\'s Run and Scavenger Hunt.', 'N', 'N', 8.1),
	('Happy Endings', 'Party Of Six', 2, 18, 'Yes', 'Yes', 'No', 14, 3, 2012, 'After years of bad luck every time the gang celebrates Penny\'s birthday, the gang starts to believe the day is cursed.', 'N', 'N', 7.9),
	('Happy Endings', 'You Snooze, You Bruise', 2, 19, 'Yes', 'Yes', 'No', 21, 3, 2012, 'Dave finds himself bullied at the gym by Corey, and former bully Alex coaches him on how to fight back. Meanwhile, the residents at Brad and Jane\'s condo are fed up with Jane being too controlling as president of their home owners\' association, and rise up to challenge her for the job.', 'N', 'N', 7.7),
	('Happy Endings', 'Big White Lies', 2, 20, 'Yes', 'Yes', 'No', 28, 3, 2012, 'Things spiral out of control after Penny tells a white lie to avoid an irritating childhood friend. Dave and Max\'s lonely and jealous landlord falls for Alex.', 'N', 'N', 8.2),
	('Happy Endings', 'Four Weddings And A Funeral (Minus Three Weddings And One Funeral)', 2, 21, 'Yes', 'Yes', 'No', 4, 4, 2012, 'The gang find themselves at yet another wedding, this time the nuptials of Derrick and Eric. Brad struggles to tell Jane something important, Jane tries to find a way to help Eric hide the fact that the pricey reception must be downscaled, and Max tries to find the courage to perform with his old all-male Madonna cover band. Meanwhile, a dateless Penny is sad that she\'s at another wedding, alone, until she meets cute guy Chris via Skype.', 'N', 'N', 8.2),
	('Happy Endings', 'Cazsh Dummy Spillionaires', 3, 1, 'Yes', 'Yes', 'No', 23, 10, 2012, 'The on-again, off-again relationship between Alex and Dave is on-again, while an accident puts Penny in a full body cast and turns Max into her angel of mercy, until he gets a eyeful of her hunky physical therapist. Later, out-of-work Brad tries to keep a secret from Jane.', 'N', 'N', 7.5),
	('Happy Endings', 'Sabado Free-Gante', 3, 2, 'Yes', 'Yes', 'No', 30, 10, 2012, 'Dave and Alex\'s inability to commit to a new apartment proves to be quite a challenge for their real-estate agent, while Jane pulls out all the stops when she takes Penny car shopping. Later, Max shows out-of-work Brad how easy it is to spend a cashless Saturday in Chicago.', 'N', 'N', 7.7),
	('Happy Endings', 'Boyz II Menorah', 3, 3, 'Yes', 'Yes', 'No', 13, 11, 2012, 'Max has become a hit on the Bar Mitzvah circuit as an energetic emcee and allows Brad to partner up with him, but not everything turns out kosher. Meanwhile Dave and Alex make an effort not to take their relationship for granted.', 'N', 'N', 7.3),
	('Happy Endings', 'More Like Stanksgiving', 3, 4, 'Yes', 'Yes', 'No', 20, 11, 2012, 'The gang celebrates Thanksgiving by watching a previously unaired episode of \'Real World\' they appeared in back in college, and, long after the fact, learn some shocking new dirt about one another.', 'N', 'N', 7.8),
	('Happy Endings', 'P&P Romance Factory', 3, 5, 'Yes', 'Yes', 'No', 4, 12, 2012, 'Penny meets a terrific new guy, Pete, but her frantic attempt to hide the fact that she\'s wearing a prescription helmet because of her concussion really limits their potential romance. Jane tries to break into the \'boys club\' at the car dealership and enlists Brad to be her \'trophy wife\'. Max and Dave\'s fist bump issues bring back painful childhood memories.', 'N', 'N', 7.5),
	('Happy Endings', 'To Serb With Love', 3, 6, 'Yes', 'Yes', 'No', 11, 12, 2012, 'Jane and Alex\'s parents throw a big celebration to commemorate the 20th anniversary of the family mattress business, and Jane agonizes over coming up with an amusing toast to spring on her humorless dad. Meanwhile, Alex tells Dave that her parents are unaware that they are once again bedfellows, and Max goes looking for a new BFF since Penny\'s tied up in her relationship with Pete.', 'N', 'N', 7.5),
	('Happy Endings', 'No-Ho-Ho', 3, 7, 'Yes', 'Yes', 'No', 18, 12, 2012, 'The gang discovers that Jane has been lying about her birthday, and that she was actually born on Christmas but never liked her natal day being trumped by the holiday. With that in mind, they throw her a celebration that is Christmas-free and all about Jane.', 'N', 'N', 7.9),
	('Happy Endings', 'Fowl Play-Date', 3, 8, 'Yes', 'Yes', 'No', 6, 1, 2013, 'After Brad and Penny accidentally break Alex\'s beloved childhood memento, they try to glue it back together which leads to an even worse situation. Meanwhile, Jane and Dave try a little too hard to find a match for Max.', 'N', 'N', 7.5),
	('Happy Endings', 'Ordinary Extraordinary Love', 3, 9, 'Yes', 'Yes', 'No', 8, 1, 2013, 'When a hot young pop star stops in and buys a dress at Alex\'s store, Penny helps Alex turns it into a press opportunity. Meanwhile, Max is having an identity crisis, so Jane and Derrick take him on a tour of Chicago\'s themed gay bars to help him find his niche, and Brad and Dave try to be \'men\' and fix things around the house.', 'N', 'N', 7.5),
	('Happy Endings', 'Kickball 2 - The Kickening', 3, 10, 'Yes', 'Yes', 'No', 13, 1, 2013, 'Alex signs up the gang to participate in the Northside Kickball Classic tournament. However, self-appointed manager Max has difficulty bringing his players up to scratch.', 'N', 'N', 7.5),
	('Happy Endings', 'The Ex Factor', 3, 11, 'Yes', 'Yes', 'No', 15, 1, 2013, 'When Ryan, Jane\'s ex, comes to town for a visit, Brad is surprised to learn that Ryan is a woman. Meanwhile Max gets a super cool new roommate, Chase, who immediately upgrades the apartment with expensive furniture and gadgets. The gang is in awe, but when Chase suddenly disappears, they start snooping into his private life.', 'N', 'N', 7.6),
	('Happy Endings', 'The Marry Prankster', 3, 12, 'Yes', 'Yes', 'No', 29, 1, 2013, 'When the gang pranks Max into thinking he won a big lotto jackpot, he vows revenge when they least suspect it. Meanwhile, Brad gets a new job as a CFO, but Jane is not amused when she learns the title is Chief Fun Officer and that Brad is working at a kids\' gym.', 'N', 'N', 8.8),
	('Happy Endings', 'Our Best Friend\'s Wedding', 3, 13, 'Yes', 'Yes', 'No', 29, 1, 2013, 'In order to get Pete to change his mind about eloping with Penny, wannabe matrimonial coordinator Jane spirits the whole gang to a wedding exposition. Once there, Max and Brad wind up at a gay-marriage part of the expo, while Alex and Dave contemplate their own commitment issues.', 'N', 'N', 7.6),
	('Happy Endings', 'In The Heat Of The Noche', 3, 14, 'Yes', 'Yes', 'No', 29, 3, 2013, 'Brad uses his skills, plus help from the gang, to prop up Chuckles and Huggs after the gym\'s loopy owner, Terry tells him it may be closing. Meanwhile, Penny and Max try to break the habit of texting the men in their lives.', 'N', 'N', 7.8),
	('Happy Endings', 'The Straight Dope', 3, 15, 'Yes', 'Yes', 'No', 29, 3, 2013, 'Max meets a cute girl who is a season tickets holder for the Bulls, leaving him no choice but to pretend to be straight. Meanwhile, Alex is tired of everyone dismissing her as the dimwitted blonde, so she becomes well read to prove them wrong and in the process throws off the whole group dynamic.', 'N', 'N', 7.7),
	('Happy Endings', 'The Incident', 3, 16, 'Yes', 'Yes', 'No', 5, 4, 2013, 'When Max tries out Jane and Alex\'s long-time hairdresser, Krisjahn, he gets some good salon gossip on the girls, but his loose lips may cause World War III between the Kerkovitch sisters. Meanwhile, the Steak Me Home truck is stolen and Dave and Penny try to figure out whodunit.', 'N', 'N', 7.3),
	('Happy Endings', 'Bros Before Bros', 3, 17, 'Yes', 'Yes', 'No', 5, 4, 2013, 'With the wedding coming up, Penny decides to reach out to her estranged dad Roy. The reunion is sufficiently awkward but Alex encourages Penny to be optimistic, while Jane is more skeptical. Meanwhile, Dave enlists Brad and Max\'s help in sabotaging \'The Brazilian\' food truck, a.k.a. Dave\'s #1 nemesis, but Max accidentally falls for the enemy\'s son and has to choose between his best friend or boyfriend.', 'N', 'N', 7.4),
	('Happy Endings', 'She Got Game Night', 3, 18, 'Yes', 'Yes', 'No', 12, 4, 2013, 'Brad and Jane host a couples game night with Penny, Pete, Max and Scotty and the competitiveness gets a little out of hand. Meanwhile Dave has a big decision to make on the career front, and Alex tries to help but they end up at a psychic instead.', 'N', 'N', 7.8),
	('Happy Endings', 'The Storm Before The Calm', 3, 19, 'Yes', 'Yes', 'No', 12, 4, 2013, 'Penny insists that she\'s fine after her breakup with Pete, but the gang begin to wonder when she writes a play entitled \'Black Plague: A Love Story\' and asks Derrick and his theater group to stage it. Meanwhile a marketing group asks Alex and Max to be taste makers.', 'N', 'N', 7.1),
	('Happy Endings', 'The Ballad Of Lon Sarofsky', 3, 20, 'Yes', 'Yes', 'No', 19, 4, 2013, 'The gang is shocked when Penny rebounds from her breakup with Pete by having a torrid affair with the last man on earth they\'d pick for her -- the Car Czar. To make matters worse, she\'s temporarily living with Brad and Jane, who end up acting like disapproving parents. Meanwhile the friends pressure Max to get a job so he\'ll stop sponging off them.', 'N', 'N', 6.8),
	('Happy Endings', 'Un-sabotagable', 3, 21, 'Yes', 'Yes', 'No', 26, 4, 2013, 'Chase, the ex-roommate whose life Max ruined, says he\'d like to take revenge and do the same thing to Max, but Max\'s life is so pathetic it\'s \'un-sabotagable\'. Max vows to prove him wrong and asks Jane to help him get his act together. Meanwhile, Alex asks the rest of the gang for help when Dave challenges her to finally use her stockpile of Groupons.', 'N', 'N', 7.4),
	('Happy Endings', 'Deuce Babylove 2 - Electric Babydeuce', 3, 22, 'Yes', 'Yes', 'No', 3, 5, 2013, 'Penny\'s mom, Dana, and Dave\'s dad, Big Dave, are in town visiting, and these two lovebirds are not only going strong, they\'ve decided to adopt a baby together, prompting Penny and Dave to react the only way they know how - irrationally. Meanwhile, Brad and Jane decide to try to join an exclusive tennis club, but unfortunately Max is on the scent and they can\'t shake him...or Alex.', 'N', 'N', 7.2),
	('Happy Endings', 'Brothas & Sisters', 3, 23, 'Yes', 'Yes', 'No', 3, 5, 2013, 'The third Kerkovich sister, Brooke, is the alpha sister of the group, and Jane has the daunting task of planning a wedding for her more perfect and exquisite older sibling. Meanwhile, Brad is having a tough time himself dealing with Brooke\'s equally more perfect African American fiance, Elliot, and Alex and Dave have a big secret they\'re hiding.', 'N', 'N', 7.7),
	('Homeland', 'Pilot', 1, 1, 'Yes', 'Yes', 'Yes', 2, 10, 2011, 'After missing and presumed dead for eight years, Marine Sergeant Nicholas Brody is rescued in Iraq, and returns home to his family. But CIA agent Carrie Mathison suspects he might have been turned by his terrorist captors, and believes he could be part of a plan to attack America.', 'Y', 'N', 8.4),
	('Homeland', 'Grace', 1, 2, 'Yes', 'Yes', 'Yes', 9, 10, 2011, 'Carrie continues to surveil Brody but is unable to follow his actions into his garage which is a blind spot, where Brody begins to perform an Islamic prayer. Meanwhile, Carrie receives visual confirmation from an undercover agent that shows Al-Qaeda member Abu Nazir on video meeting with the Royal Prince of the Kingdom of Saudi Arabia.', 'Y', 'N', 8.1),
	('Homeland', 'Clean Skin', 1, 3, 'Yes', 'Yes', 'Yes', 16, 10, 2011, 'Brody prepares to enter the spotlight. Carrie closes in on an al-Qaeda plot.', 'Y', 'N', 8),
	('Homeland', 'Semper I', 1, 4, 'Yes', 'Yes', 'Yes', 23, 10, 2011, 'The political powers that be make big plans for national hero Brody, but his increasingly erratic behavior threatens his media darling status; Carrie grows desperate for evidence linking Brody with Abu Nazir, as Saul directs her to focus on Nazir\'s money trail.', 'Y', 'N', 7.9),
	('Homeland', 'Blind Spot', 1, 5, 'Yes', 'Yes', 'Yes', 30, 10, 2011, 'Brody confronts the lone survivor among the insurgents that held him, leading Carrie to believe she may be proved right about Brody once and for all - but Brody\'s reunion with his captor surprises everyone; the agency is hot on the trail of the lovers who bought a house near the airport with funds from a stolen necklace.', 'Y', 'N', 8.4),
	('Homeland', 'The Good Soldier', 1, 6, 'Yes', 'Yes', 'Yes', 6, 11, 2011, 'Reeling after losing key players in Nazir\'s plot against America, the CIA orders polygraphs on everyone who came in contact with them, including Brody, which Carrie sees as an opportunity to finally learn the truth.', 'Y', 'N', 8.5),
	('Homeland', 'The Weekend', 1, 7, 'Yes', 'Yes', 'Yes', 13, 11, 2011, 'The relationship between Carrie and Brody becomes more complicated when they head into the countryside for the weekend, while Mike and Jessica face the fallout of the truth about their relationship, and Saul catches Aileen on the run to Mexico.', 'Y', 'N', 8.9),
	('Homeland', 'Achilles Heel', 1, 8, 'Yes', 'Yes', 'Yes', 20, 11, 2011, 'As Carrie and Saul reel from the news that Walker is alive, the intelligence community clashes on the best way to capture him; Brody learns a shocking truth about his captivity.', 'Y', 'N', 8.4),
	('Homeland', 'Crossfire', 1, 9, 'Yes', 'Yes', 'Yes', 27, 11, 2011, 'After his attempt to sever ties with Abu Nazir, Brody finds himself reliving his captivity and recommits to his mission; Carrie finds herself in the middle of a public relations nightmare on the heels of the mosque shooting.', 'Y', 'N', 8.2),
	('Homeland', 'Representative Brody', 1, 10, 'Yes', 'Yes', 'Yes', 4, 12, 2011, 'Carrie and Saul identify Walker\'s contact in Washington but their target has diplomatic immunity. Brody is approached to run for a disgraced congressman\'s seat in the House of Representatives. ', 'Y', 'N', 8.3),
	('Homeland', 'The Vest', 1, 11, 'Yes', 'Yes', 'Yes', 11, 12, 2011, 'In the wake of the explosion, Saul finds Carrie hospitalized and manic, but realizes her chaotic theories have merit; before his congressional campaign begins, Brody takes his family on a weekend trip to Gettysburg, where he retrieves an important item.', 'Y', 'N', 8.7),
	('Homeland', 'Marine One', 1, 12, 'Yes', 'Yes', 'Yes', 18, 12, 2011, 'While Carrie is near catatonic and confined to bed, Saul investigates the unsettling implications of her timeline; Walker secures a perch for his mission; Brody makes his final preparations for the Vice President\'s policy summit at the State Department.', 'Y', 'N', 9.1),
	('Homeland', 'The Smile', 2, 1, 'Yes', 'Yes', 'Yes', 30, 9, 2012, 'Months after undergoing Electroconvulsive Therapy, former CIA case officer Carrie Mathison has found a modicum of peace in her family\'s suburban embrace. But the strides she\'s made towards mental health are threatened when an asset from her former life comes in from the cold. Meanwhile, freshman Congressman Nick Brody discovers that Abu Nazir may not be content with his nonviolent approach to affecting change in American foreign policy. Brody\'s daughter Dana lets a vital secret slip.', 'Y', 'N', 8.5),
	('Homeland', 'Beirut Is Back', 2, 2, 'Yes', 'Yes', 'Yes', 7, 10, 2012, 'Fatima tells Carrie about a meeting her Hezbollah commander husband will be having in Beirut with Abu Nazir and Carrie and Saul request a special forces team to capture him.', 'Y', 'N', 9),
	('Homeland', 'State Of Independence', 2, 3, 'Yes', 'Yes', 'Yes', 14, 10, 2012, 'After her Beirut adventures, Carrie hopes for a triumphant return to the CIA. Brody learns that his bomb maker is in danger of imminent discovery and attempts a last minute extraction. Jessica steps into the political limelight.', 'Y', 'N', 8.3),
	('Homeland', 'New Car Smell', 2, 4, 'Yes', 'Yes', 'Yes', 21, 10, 2012, 'Estes authorizes a covert operation to investigate intel recovered in Beirut. Brody gets a shock when he runs into Carrie at Langley. Dana discovers she has something in common with the Vice President\'s son.', 'Y', 'N', 8.8),
	('Homeland', 'Q & A', 2, 5, 'Yes', 'Yes', 'Yes', 28, 10, 2012, 'Brody is a prisoner again. Carrie plays second fiddle after her rash judgment call at the hotel as Estes is busy keeping Jessica off their trail. Dana and Finn\'s date night turns deadly serious.', 'Y', 'N', 9.1),
	('Homeland', 'A Gettysburg Address', 2, 6, 'Yes', 'Yes', 'Yes', 4, 11, 2012, 'Dana is shocked by her visit to the hospital. Faber\'s Tom Walker questions get him tangled up with the CIA. Brody agrees to help stop an attack on America, but his loyalty is questioned when Gettysburg once again becomes a battleground.', 'Y', 'N', 8.4),
	('Homeland', 'The Clearing', 2, 7, 'Yes', 'Yes', 'Yes', 11, 11, 2012, 'Carrie and the team struggle to regain control of their operation. Saul visits Aileen in solitary confinement. Dana pressures Finn to come clean about their hidden crime with unforeseen consequences.', 'Y', 'N', 7.9),
	('Homeland', 'I\'ll Fly Away', 2, 8, 'Yes', 'Yes', 'Yes', 18, 11, 2012, 'Brody heads towards meltdown as he struggles to keep his complicated alliances clear. Carrie stages a risky intervention to keep Brody in line, forcing both of them to confront their mixed emotions. Dana turns to an unlikely source for comfort.', 'Y', 'N', 8.3),
	('Homeland', 'Two Hats', 2, 9, 'Yes', 'Yes', 'Yes', 25, 11, 2012, 'Brody makes a necessary phone call. Saul teams up with Virgil and Max to dig up some information on one of their own. Carrie finds herself preparing for the most important meeting of her career.', 'Y', 'N', 8.6),
	('Homeland', 'Broken Hearts', 2, 10, 'Yes', 'Yes', 'Yes', 2, 12, 2012, 'Saul catches up with an old friend and discovers evidence of covert activities by Estes. Brody and Vice President Walden find themselves at odds over the future of their political relationship, while Dana and Finn come to terms with their own differences.', 'Y', 'N', 8.7),
	('Homeland', 'The Memoriam', 2, 11, 'Yes', 'Yes', 'Yes', 9, 12, 2012, 'Dangerously close to exhaustion, Carrie continues her hunt for Nazir and begins to suspect there is a mole in the CIA. Roya reveals her true colours under interrogation and Saul finds himself fighting to save his career under unexpected circumstances. Meanwhile, the Brodys struggle to maintain anything close to a state of sanity.', 'Y', 'N', 8.7),
	('Homeland', 'The Choice', 2, 12, 'Yes', 'Yes', 'Yes', 16, 12, 2012, 'Carrie is faced with a pivotal decision, while Brody meets with Faber to contemplate the future of the family. Meanwhile, Saul undertakes a secret assignment; and Quinn has a decision to make that may prove to be a game-changer.', 'Y', 'N', 9.3),
	('Homeland', 'Tin Man Is Down', 3, 1, 'Yes', 'Yes', 'Yes', 29, 9, 2013, 'Alleged Langley bomber Nick Brody remains at large. Saul plots a risky counterstrike on the terrorists connected to the bombing. Carrie becomes the focus of a hostile Senate investigation. Humiliated and abandoned by the Marine Corps, the Brody family struggles to cope with Dana\'s destructive behavior.', 'Y', 'N', 8),
	('Homeland', 'Uh... Oh... Ah...', 3, 2, 'Yes', 'Yes', 'Yes', 6, 10, 2013, 'Saul attempts to track down those responsible for the Langley attack and recruits an unlikely expert to follow the money trail. Meanwhile, Quinn takes matters into his own hands; Carrie learns who is really on her side; and the Brody family turn to therapy to mend their broken household.', 'Y', 'N', 7.3),
	('Homeland', 'Tower Of David', 3, 3, 'Yes', 'Yes', 'Yes', 13, 10, 2013, 'As Brody finds himself in increasingly desperate straits, he returns to his faith for guidance in an unexpected way. Carrie struggles to connect with Saul when a mysterious man offers to help her, but at a great cost.', 'Y', 'N', 7.4),
	('Homeland', 'Game On', 3, 4, 'Yes', 'Yes', 'Yes', 20, 10, 2013, 'Carrie learns that even in its crippled state, the CIA can still exercise power when needed. Dana Brody goes AWOL, forcing Jessica to go to the police. Saul and Fara follow the money trail to an unexpected location, and Carrie has breakfast with a new client.', 'Y', 'N', 8.3),
	('Homeland', 'The Yoga Play', 3, 5, 'Yes', 'Yes', 'Yes', 27, 10, 2013, 'Carrie puts her mission on the line to do a risky favor. Saul is forced to rub elbows with his adversary, Senator Lockhart, on a hunting trip. Still on the run, Dana makes a shocking discovery.', 'Y', 'N', 8.1),
	('Homeland', 'Still Positive', 3, 6, 'Yes', 'Yes', 'Yes', 3, 11, 2013, 'Carrie turns the tables on the mastermind of the Langley bombing, but recruiting one of Iran\'s most powerful operatives has dangerous consequences. Meanwhile, Saul struggles to keep an intrusive Senator Lockhart at bay, and Dana makes a radical decision that will change the Brody family forever.', 'Y', 'N', 8),
	('Homeland', 'Gerontion', 3, 7, 'Yes', 'Yes', 'Yes', 10, 11, 2013, 'With an old adversary in custody, Saul makes the gamble of his career. Carrie and Quinn scramble to contain a local police investigation, while Mira finds her marriage at a crossroads.', 'Y', 'N', 8.3),
	('Homeland', 'A Red Wheelbarrow', 3, 8, 'Yes', 'Yes', 'Yes', 17, 11, 2013, 'After new information comes to light, Carrie and Quinn pursue a key suspect in the Langley bombing. Saul deals with political backlash while Fara discovers the toll an intelligence job can take. Meanwhile, the Brody family gets startling news.', 'Y', 'N', 8.5),
	('Homeland', 'One Last Thing', 3, 9, 'Yes', 'Yes', 'Yes', 24, 11, 2013, 'Carrie reunites with Brody, but the circumstances are more difficult than either of them could have imagined. Meanwhile, Saul gets a win from an unlikely source, and Dana grapples with her new life away from home.', 'Y', 'N', 8.6),
	('Homeland', 'Good Night', 3, 10, 'Yes', 'Yes', 'Yes', 1, 12, 2013, 'Brody embarks on a high stakes mission, but his fragile condition threatens the entire operation. Quinn makes an uncomfortable discovery about Carrie, while a sudden crisis forces Fara to rejoin the team.', 'Y', 'N', 8.9),
	('Homeland', 'Big Man In Tehran', 3, 11, 'Yes', 'Yes', 'Yes', 8, 12, 2013, 'Brody\'s loyalty to the mission wavers when he meets a ghost from his past. Meanwhile, Lockhart\'s confirmation looms; and Saul stares into the precipice between success and failure.', 'Y', 'N', 9.3),
	('Homeland', 'The Star', 3, 12, 'Yes', 'Yes', 'Yes', 15, 12, 2013, 'Security forces are closing in on Carrie and Brody, and Brody continues struggling to find redemption. Meanwhile, Saul plans a last-ditch rescue mission.', 'Y', 'N', 8.4),
	('Homeland', 'The Drone Queen', 4, 1, 'Yes', 'Yes', 'Yes', 5, 10, 2014, 'As CIA Chief of Station in Kabul, Carrie makes a critical decision when her counterpart in Islamabad delivers urgent intelligence on a high value target. Saul struggles to adjust to his new role in the private sector.', 'Y', 'N', 8.4),
	('Homeland', 'Trylon And Perisphere', 4, 2, 'Yes', 'Yes', 'Yes', 5, 10, 2014, 'An official inquiry brings Carrie back to the States, where she struggles with her ambivalence towards motherhood. Quinn spirals out of control. A disgraced former case officer reveals disturbing new information.', 'Y', 'N', 7.7),
	('Homeland', 'Shalwar Kameez', 4, 3, 'Yes', 'Yes', 'Yes', 12, 10, 2014, 'Carrie ventures a delicate alliance with her counterpart at Pakistans secretive Inter-Services Intelligence (ISI). Fara fails to recruit a key asset, forcing Carrie to intervene. Still reeling over events in Islamabad, Quinn zeroes in on a potential lead.', 'Y', 'N', 8.1),
	('Homeland', 'Iron In The Fire', 4, 4, 'Yes', 'Yes', 'Yes', 19, 10, 2014, 'Carrie gets a tip from Redmond regarding Quinn\'s lead. Saul calls in a favor with an old friend in the Pakistani military. Fara uncovers a deep-rooted conspiracy.', 'Y', 'N', 8),
	('Homeland', 'About A Boy', 4, 5, 'Yes', 'Yes', 'Yes', 26, 10, 2014, 'Carrie tries to earn the trust of a frightened asset. On his way out of town, Saul catches a break when he spots a familiar face. Quinn and Fara stake out a new suspect.', 'Y', 'N', 7.7),
	('Homeland', 'From A To B And Back Again', 4, 6, 'Yes', 'Yes', 'Yes', 2, 11, 2014, 'Carrie puts her operation in motion. To get to Haqqani she bugs Aayan and fakes a chase after him. When Aayan and Haqqani meet up Haqqani shoots him and Saul shows up as Haqqani\'s prisoner.', 'Y', 'N', 9),
	('Homeland', 'Redux', 4, 7, 'Yes', 'Yes', 'Yes', 9, 11, 2014, 'CIA Director Lockhart arrives with the authority to use major ressources to lead Saul\'s rescue and the negotiation with the Pakistani delegation. Dennis Boyd gets to manipulate Carrie by swapping her medicine wherefore she starts to lose her mind. While it seems impossible to get Saul using military forces Haqqani prepares for a prisoner exchange that includes Saul and several afghani held prisoner by the US. After Carrie rushed into a hospital to query on Aayans girlfriend she ends up arrested in an asylum.', 'Y', 'N', 8.8),
	('Homeland', 'Halfway To A Donut', 4, 8, 'Yes', 'Yes', 'Yes', 16, 11, 2014, 'Carrie organizes a last-ditch operation. Lockhart and Martha stall the ISI.', 'Y', 'N', 9.2),
	('Homeland', 'There\'s Something Else Going On', 4, 9, 'Yes', 'Yes', 'Yes', 23, 11, 2014, 'Carrie improvises to salvage her mission. The CIA closes in on a leak.', 'Y', 'N', 9.7),
	('Homeland', '13 Hours In Islamabad', 4, 10, 'Yes', 'Yes', 'Yes', 7, 12, 2014, 'The security breach at the Embassy has far reaching consequences.', 'Y', 'N', 9.4),
