	('Homeland', 'Sock Puppets', 6, 9, 'Yes', 'Yes', 'No', 19, 3, 2017, 'Carrie catches a break. Keane makes a plan. Max goes undercover.', 'N', 'N', 8.7),
	('Homeland', 'The Flag House', 6, 10, 'Yes', 'Yes', 'No', 26, 3, 2017, 'Dar plays his hand. Quinn revisits his past.', 'N', 'N', 8.8),
	('Homeland', 'R Is For Romeo', 6, 11, 'Yes', 'Yes', 'No', 2, 4, 2017, 'Carrie and Quinn make a discovery while Keane makes a decision and Max finds trouble.', 'N', 'N', 9.1),
	('Homeland', 'America First', 6, 12, 'Yes', 'Yes', 'No', 9, 4, 2017, 'Season Finale. Pieces fall into place.', 'N', 'N', 8.4),
	('House MD', 'Everybody Lies', 1, 1, 'Yes', 'Yes', 'No', 16, 11, 2004, 'A Kindergarten teacher starts speaking gibberish and passed out in front of her class. What looks like a possible brain tumor does not respond to treatment and provides many more questions than answers for House and his team as they engage in a risky trial-and-error approach to her case. When the young teacher refuses any additional variations of treatment and her life starts slipping away, House must act against his code of conduct and make a personal visit to his patient to convince her to trust him one last time.', 'Y', 'N', 8.7),
	('House MD', 'Paternity', 1, 2, 'Yes', 'Yes', 'No', 23, 11, 2004, 'When a teenage lacrosse player is stricken with an unidentifiable brain disease, Dr. House and the team hustle to give his parents answers. Chase breaks the bad news, the kid has MS, but the boy\'s night-terror hallucinations disprove the diagnosis and send House and his team back to square one. As the boy\'s health deteriorates. House\'s side-bet on the paternity of the patient infuriates Dr. Cuddy and the teenager\'s parents, but may just pay off in spades.', 'Y', 'N', 8.4),
	('House MD', 'Occam\'s Razor', 1, 3, 'Yes', 'Yes', 'No', 30, 11, 2004, 'A college student collapses after rowdy sex with his girlfriend. While House and his team attempt to determine the cause, the student\'s condition continues to deteriorate and his symptoms multiply complicating the diagnosis.', 'Y', 'N', 8.5),
	('House MD', 'Maternity', 1, 4, 'Yes', 'Yes', 'No', 7, 12, 2004, 'When a virus is spreading among the hospital, infecting six babies, House and his team must make decisions that could compromise the lives of the babies.', 'Y', 'N', 8.5),
	('House MD', 'Damned If You Do', 1, 5, 'Yes', 'Yes', 'No', 14, 12, 2004, 'A nun whose hands are red, swollen and cracked is sent to House. The nun believes it is stigmata, but House suspects an allergic reaction. He gives her some pills, which cause her to become unable to breathe. As her condition worsens, her fellow sisters pray for her while House and his team work to discover the cause of her illness while House has to wonder if he misadministered the illness.', 'Y', 'N', 8.4),
	('House MD', 'The Socratic Method', 1, 6, 'Yes', 'Yes', 'No', 21, 12, 2004, 'Dr. House is intrigued by the symptoms of a schizophrenic woman, who displays mixed symptoms, including a tumor, but soon realizes the source of her problems isn\'t the obvious. House confronts his birthday and Chase confronts his past when the mother\'s son tries to keep up with her condition.', 'Y', 'N', 8.7),
	('House MD', 'Fidelity', 1, 7, 'Yes', 'Yes', 'No', 28, 12, 2004, 'After being discovered dead asleep, a woman is admitted to the hospital. The doctors are puzzled by her symptoms, as they consider everything from tumors to breast cancer to rabbit fever. When all the treatments fail, House concludes she has African sleeping sickness. However, neither the woman nor her husband could possibly have ever been to Africa. The woman will die without the proper treatment, but neither one will admit to having an affair.', 'Y', 'N', 8.5),
	('House MD', 'Poison', 1, 8, 'Yes', 'Yes', 'No', 25, 1, 2005, 'When a high school student falls victim to a mysterious but lethal poisoning, House and his team jump in to find out what is killing the teen. Suddenly, a second unrelated student is admitted with identical symptoms. With the boys\' lives hanging in the balance, House and the team have to connect the dots fast. Meanwhile, an 82-year-old patient has become enamored with House while he helps her figure out the basis of her renewed fascination with her sexual feelings.', 'Y', 'N', 8.4),
	('House MD', 'DNR', 1, 9, 'Yes', 'Yes', 'No', 1, 2, 2005, 'Legendary jazz musician John Henry Giles is checked into the hospital and when he\'s told he\'s dying from ALS, he signs a DNR to avoid a slow death. House disagrees with the diagnosis and goes against everyone\'s wishes when he violates the DNR to save Giles\' life. The decision lands House in court, drives Foreman to consider taking another job, and results in Giles\' paralysis worsening. But when the patient inexplicably starts getting better, the team has to figure out the mystery in reverse and find out why his condition is improving.', 'Y', 'N', 8.9),
	('House MD', 'Histories', 1, 10, 'Yes', 'Yes', 'No', 8, 2, 2005, 'Dr. Foreman believes an uncooperative homeless woman is faking seizures to get a meal ticket at the teaching hospital. But her homelessness strikes a personal chord with Dr. Wilson and he grows determined to keep her from falling between the cracks. Her worsening symptoms prove to be a complex mystery for House and his team, but the mystery of her identity and medical history may hold the answers to saving her life. Just as the team suspects she has contagious meningitis, the woman goes missing, only to be tasered by the police, who bring her back. But House deduces the taser may have proven yet another diagnosis, with dire results. Meanwhile, House has an audience of two medical students who are learning how to do case studies.', 'Y', 'N', 8.6),
	('House MD', 'Detox', 1, 11, 'Yes', 'Yes', 'No', 15, 2, 2005, 'House has to find out why a patient has internal bleedings after a car crash. In the meantime, he has a wager with Cuddy he can stay off the painkillers. Will his withdrawal symptoms eventually kill his patient?', 'Y', 'N', 8.9),
	('House MD', 'Sports Medicine', 1, 12, 'Yes', 'Yes', 'No', 22, 2, 2005, 'A severely broken arm reveals a bizarre case of bone loss and ends the comeback plans of major league pitcher Hank Wiggen. House suspects Hank is lying about using steroids, as his condition worsens. When Hank\'s kidneys start to fail, his wife offers to donate hers, but she would have to abort her early pregnancy. Forced into an impossible solution, and admitting failure as an addict, Hank tries to take his own life. House and his team must isolate and fix the problem soon if this pitcher\'s life, as well his career, can be saved. Meanwhile, Foreman dates a pharmaceutical representative and House is stuck with two tickets and ends up going on a date with Cameron...to a monster truck rally.', 'Y', 'N', 8.3),
	('House MD', 'Cursed', 1, 13, 'Yes', 'Yes', 'No', 1, 3, 2005, 'A 12-year-old boy believes he\'s cursed after a Ouija board tells him he\'s going to die, and his father makes increasing demands on House as they try to diagnose the boy\'s pneumonia-like symptoms and incongruous rash. Meanwhile, Chase\'s estranged father, a renowned doctor from Australia, visits and House invites him to sit in, much to Chase\'s discomfort. When House diagnoses the boy\'s illness, the young patient is forced to face the idea that his father may not be everything he believes.', 'Y', 'N', 8.4),
	('House MD', 'Control', 1, 14, 'Yes', 'Yes', 'No', 15, 3, 2005, 'Billionaire entrepreneur Edward Vogler spends $100 million on the clinic and becomes the new Chairman of the Board. As a businessman, Vogler intends to turn the clinic into a profitable venue for his biotech venture and plans to eliminate the financially draining services of Dr. House. Meanwhile, a businesswoman who has it all - perfect life, perfect body, perfect job - finds herself inexplicably paralyzed. When he diagnoses her secret, House must risk his job and his medical license to get her a necessary transplant.', 'Y', 'N', 8.9),
	('House MD', 'Mob Rules', 1, 15, 'Yes', 'Yes', 'No', 22, 3, 2005, 'Just before mobster Joey Arnello spills the beans in federal court and enters witness protection, he collapses. A court order instructs House to find out if he\'s faking. House and his team struggle to diagnose and cure Joey while Joey\'s brother Bill tries to slow things down and keep Joey from testifying. Meanwhile, Cuddy struggles to convince Vogler that House is an essential part of the hospital.', 'Y', 'N', 8.3),
	('House MD', 'Heavy', 1, 16, 'Yes', 'Yes', 'No', 29, 3, 2005, 'House must fire one of his doctors and leaves them to think about it while they deal with an overweight 10-year old child who suffered a heart attack as the result of taking diet pills. House is also faced with a woman who won\'t accept surgery for a 30 lb. tumor because she wants to remain overweight.', 'Y', 'N', 8.6),
	('House MD', 'Role Model', 1, 17, 'Yes', 'Yes', 'No', 12, 4, 2005, 'At a high-level campaign fundraiser, a senator becomes violently ill. Vogler forces House to take the senator\'s case and offers to let off the hook on firing a team member if he\'ll deliver a speech on behalf of Vogler\'s pharmaceutical company. It looks like the senator has AIDS but House refuses to settle for the easy answer. And House ends up giving the speech, but it doesn\'t go quite as Vogler planned.', 'Y', 'N', 8.7),
	('House MD', 'Babies And Bathwater', 1, 18, 'Yes', 'Yes', 'No', 19, 4, 2005, 'While House and his team scramble to discover what\'s causing brain and kidney dysfunction in a pregnant woman, Vogler is working to get House fired after House\'s pharmaeutical speech. House determines the illness, but the woman and her husband must struggle with an emotional and heartbreaking choice: choose between her or that of her unborn child. Vogler calls for a vote to remove House, but when Wilson refuses to make the vote unanimous, Vogler threatens to take his money if Wilson isn\'t voted out. Finally, Cuddy must take a stand against Vogler.', 'Y', 'N', 9),
	('House MD', 'Kids', 1, 19, 'Yes', 'Yes', 'No', 3, 5, 2005, 'During an meningitis outbreak which overwhelms the clinic, House is drawn to a single patient: a 12-year-old whose symptoms don\'t quite match everyone else\'s. House, Foreman, and Chase must devise ingenious ways and locations to treat the girl\'s delicate condition in the middle of the chaos, and make an unexpected discovery. Meanwhile, House asks Cameron to come back to her job but she has one requirement that he might not be able to meet.', 'Y', 'N', 8.5),
	('House MD', 'Love Hurts', 1, 20, 'Yes', 'Yes', 'No', 10, 5, 2005, 'House apparently triggers a stroke in a clinic patient, but the major topic of discussion is House\'s imminent date with Cameron, The team must deal with the patient\'s odd lifestyle, overbearing \'friend\', and reluctant parents in order to stop the strokes and try to save his life. Meanwhile, Wilson, Cuddy and the team offer House and Cameron advice while laying odds on the outcome.', 'Y', 'N', 8.6),
	('House MD', 'Three Stories', 1, 21, 'Yes', 'Yes', 'No', 17, 5, 2005, 'House\'s ex-girlfriend Stacy Warner returns not for House but to get help for her ailing husband. While House decides whether or not to take her case, Cuddy forces him to present a lecture to a class of medical students. As he weaves the stories of three patients who all present with a similar symptom, House gives a lecture the students will never forget.', 'Y', 'N', 9.7),
	('House MD', 'Honeymoon', 1, 22, 'Yes', 'Yes', 'No', 24, 5, 2005, 'When Stacy insists her husband Mark get tests, House insists he can handle things. But despite the fact Mark\'s tests prove negative, his steadily growing symptoms indicate he is dying. While House struggles with the mystery and make increasing demands on his staff, Wilson worries about House\'s emotional well-being, and Cuddy considers adding a new employee to the clinic.', 'Y', 'N', 8.8),
	('House MD', 'Acceptance', 2, 1, 'Yes', 'Yes', 'No', 13, 9, 2005, 'A death row inmate is felled by an unknown disease and House decides to take on the case, over Cuddy and Foreman\'s objections. House also has to deal with Stacy who is working closely with him, while Cameron has to cope with a dying patient.', 'Y', 'N', 8.6),
	('House MD', 'Autopsy', 2, 2, 'Yes', 'Yes', 'No', 20, 9, 2005, 'Dr. Wilson convinces House to take the case of one of his patients, a young girl with terminal cancer who starts suffering from hallucinations.', 'Y', 'N', 9.3),
	('House MD', 'Humpty Dumpty', 2, 3, 'Yes', 'Yes', 'No', 27, 9, 2005, 'An asthmatic man suddenly becomes unconscious and falls off of Dr. Cuddy\'s roof while working on her house.', 'Y', 'N', 8.2),
	('House MD', 'TB Or Not TB', 2, 4, 'Yes', 'Yes', 'No', 1, 11, 2005, 'While in Africa, a famous doctor becomes inexplicably ill and is sent to Dr. House for treatment.', 'Y', 'N', 8.4),
	('House MD', 'Daddy\'s Boy', 2, 5, 'Yes', 'Yes', 'No', 8, 11, 2005, 'A Princeton student who is graduating suffers a seizure while partying at a frat house. House\'s parents also drop by to see their son.', 'Y', 'N', 8.3),
	('House MD', 'Spin', 2, 6, 'Yes', 'Yes', 'No', 15, 11, 2005, 'A professional bicyclist is brought in after collapsing during a race, but House doesn\'t want to treat him because he thinks the athlete is taking performance-enhancing drugs. House only becomes interested when the patient admits to taking the drugs.', 'Y', 'N', 8.2),
	('House MD', 'Hunting', 2, 7, 'Yes', 'Yes', 'No', 22, 11, 2005, 'A gay man with full-blown AIDS collapses in front of House\'s home and goes into shock. When House discovers the man\'s father is suffering from symptoms of his own, he must determine if they might be connected and save both their lives. Meanwhile, Cameron faces a potentially life-threatening disease of her own.', 'Y', 'N', 8.6),
	('House MD', 'The Mistake', 2, 8, 'Yes', 'Yes', 'No', 29, 11, 2005, 'House and Chase find themselves in a serious situation after a young mother with stomach pains dies. Months later, Stacy counsels Chase prior to his disciplinary hearing, and must determine whether Chase made a mistake that ultimately led to the patient\'s death. She soon realizes he is holding something back.', 'Y', 'N', 9),
	('House MD', 'Deception', 2, 9, 'Yes', 'Yes', 'No', 13, 12, 2005, 'With Foreman as House\'s supervisor, the team must figure out if a woman who cried wolf too many times is really ill.', 'Y', 'N', 8.7),
	('House MD', 'Failure To Communicate', 2, 10, 'Yes', 'Yes', 'No', 10, 1, 2006, 'While attending his editor\'s retirement party, a journalist collapses and hits his head on a desk. When he regains consciousness, his sentences are garbled and incoherent, so he is rushed to Princeton Plainsboro Teaching Hospital. With House and Stacy stranded at an airport due to bad weather, the team is forced to solve the case with House helping out over the phone.', 'Y', 'N', 8.7),
	('House MD', 'Need To Know', 2, 11, 'Yes', 'Yes', 'No', 7, 2, 2006, 'While House\'s staff tries to diagnose a woman whose uncontrollable muscle flailing caused her to crash her car, House and Stacy try to resolve their relationship issues once and for all. Cameron refuses to take her HIV test, wary of the results.', 'Y', 'N', 8.4),
	('House MD', 'Distractions', 2, 12, 'Yes', 'Yes', 'No', 14, 2, 2006, 'While a severely burned teenager is admitted and his blood tests come back with strange results, House makes himself the guinea pig in his own unofficial tests of a new drug designed to treat migraines to prove a former medical school colleague is wrong about the drug.', 'Y', 'N', 8.8),
	('House MD', 'Skin Deep', 2, 13, 'Yes', 'Yes', 'No', 20, 2, 2006, 'House uncovers a startling secret when he treats a teenage supermodel for heroin addiction. Meanwhile, Wilson hopes the increased leg pain in House\'s leg is an indication his leg nerves are regenerating.', 'Y', 'N', 8.9),
	('House MD', 'Sex Kills', 2, 14, 'Yes', 'Yes', 'No', 7, 3, 2006, 'House takes the case of a man who experienced a seizure but wasn\'t aware it happened. When the man suffers a heart attack and needs a heart transplant, the team races to diagnose a dead woman\'s illness so they can harvest her heart to save their living patient.', 'Y', 'N', 8.7),
	('House MD', 'Clueless', 2, 15, 'Yes', 'Yes', 'No', 28, 3, 2006, 'House believes a woman is trying to kill her husband and tries to find the proof to confirm his suspicions. When Wilson moves in with House after separating from his wife, he learns Wilson is a great cook.', 'Y', 'N', 8.7),
	('House MD', 'Safe', 2, 16, 'Yes', 'Yes', 'No', 4, 4, 2006, 'Melinda, a troubled teenage girl who is immuno-compromised as a result of the medications she must take after a heart transplant, has a severe allergic reaction and goes into shock when her boyfriend visits her. Meanwhile, House and Wilson continue to work out the problems in their new living arrangement.', 'Y', 'N', 8.9),
	('House MD', 'All In', 2, 17, 'Yes', 'Yes', 'No', 11, 4, 2006, 'When a six-year-old boy is brought in with the same symptoms as another patient who died years ago under House\'s care, House believes the cases are identical and he can predict the course of the boy\'s illness. Meanwhile, the clinic hosts a poker night to benefit the oncology department.', 'Y', 'N', 9.1),
	('House MD', 'Sleeping Dogs Lie', 2, 18, 'Yes', 'Yes', 'No', 18, 4, 2006, 'House has to work fast when a woman comes in with a life-threatening case of insomnia. Meanwhile Cameron is angry at Foreman for stealing an article she worked on.', 'Y', 'N', 8.5),
	('House MD', 'House Vs God', 2, 19, 'Yes', 'Yes', 'No', 25, 4, 2006, 'House treats a 15 year old faith healer, while Wilson feels left out when he finds out House has a weekly poker game.', 'Y', 'N', 8.8),
	('House MD', 'Euphoria - 1', 2, 20, 'Yes', 'Yes', 'No', 1, 5, 2006, 'When a police officer with a gunshot wound to the head and uncontrollable laughter is admitted, House and the team are baffled. When Foreman begins showing the same symptoms, they race to determine the cause of the illness before Foreman\'s condition takes the same path.', 'Y', 'N', 9.2),
	('House MD', 'Euphoria - 2', 2, 21, 'Yes', 'Yes', 'No', 3, 5, 2006, 'Foreman continues to experience the same progression of symptoms as the police officer. When he realizes he may be facing imminent death, he calls his father who comes to his son\'s side. As it comes down to a race against time, House believes the solution to the illness is in the police officer\'s apartment.', 'Y', 'N', 9.3),
	('House MD', 'Forever', 2, 22, 'Yes', 'Yes', 'No', 9, 5, 2006, 'A young mother has a seizure while bathing her newborn son and nearly drowns him. House and the team have two cases at one time as they try to save the infant and determine the cause of the mother\'s seizures.', 'Y', 'N', 8.4),
	('House MD', 'Who\'s Your Daddy', 2, 23, 'Yes', 'Yes', 'No', 16, 5, 2006, 'A 16-year-old Hurricane Katrina victim suffering from hallucinations as a result of the tragedy is brought to House by his former bandmate who recently found out the girl is his daughter. Although House fears his friend is being scammed, he takes the case. As he works his way through the girl\'s lies so he can diagnose and treat her, he\'s forced to tell a few lies of his own.', 'Y', 'N', 8),
	('House MD', 'No Reason', 2, 24, 'Yes', 'Yes', 'No', 23, 5, 2006, 'As House and his team are working on the diagnosis of a man with a giant, swollen tongue, the husband of a former patient walks into House\'s office and shoots him. House continues to treat his patient from his ICU hospital bed with the shooter, who has been shot by hospital security and hand-cuffed to his bed, as his roommate. When the after-effects of the shooting begin to impact House, he starts to question his own ability to diagnose properly. As his patient\'s body deteriorates, House struggles through his self-doubt and must trust his team to find a way to solve the case.', 'Y', 'N', 9.5),
	('House MD', 'Meaning', 3, 1, 'Yes', 'Yes', 'No', 5, 9, 2006, 'After recovering from his gunshot wounds, House works feverishly on two cases at the same time: a paralyzed man who drove his wheelchair into a swimming pool and a woman who became paralyzed after a yoga session.', 'Y', 'N', 9),
	('House MD', 'Cane And Able', 3, 2, 'Yes', 'Yes', 'No', 12, 9, 2006, 'House and the team treat a young boy who claims there is a tracking device in his neck and believes he has been the subject of alien experimentation. Cameron is outraged when she learns Cuddy and Wilson have been lying to House about the diagnosis on his last case.', 'Y', 'N', 8.6),
	('House MD', 'Informed Consent', 3, 3, 'Yes', 'Yes', 'No', 19, 9, 2006, 'House puts a well-known medical researcher through a battery of tests to determine why he collapsed in his lab. When the team is unable to diagnose the problem, the doctor asks the team to help him end his life. House is forced to use his cane again after the ketamine has worn off as he deals with a clinic patient\'s teenaged daughter who has a crush on him.', 'Y', 'N', 8.8),
	('House MD', 'Lines In The Sand', 3, 4, 'Yes', 'Yes', 'No', 26, 9, 2006, 'When doctors are unable to diagnose why a severely autistic boy screams loudly for no apparent reason, House takes the case. As the boy\'s condition worsens, it becomes obvious that House relates to the boy because he has no social niceties.', 'Y', 'N', 9.1),
	('House MD', 'Fools For Love', 3, 5, 'Yes', 'Yes', 'No', 31, 10, 2006, 'House takes the case of a young woman who has been rushed to the hospital with problems breathing and severe stomach pain after she and her husband were robbed. After her husband collapses, the team believes the couple\'s illnesses are related. Meanwhile, Michael Tritter, a clinic patient, causes problems for House that could have serious ramifications.', 'Y', 'N', 8.6),
	('House MD', 'Que Sera Sera', 3, 6, 'Yes', 'Yes', 'No', 7, 11, 2006, 'The team encounters logistical problems while trying to run tests on a 600-pound man due to his extremely large size. Meanwhile, House spends the night in jail after being arrested by Detective Tritter for various charges, including resisting arrest.', 'Y', 'N', 8.5),
	('House MD', 'Son Of Coma Guy', 3, 7, 'Yes', 'Yes', 'No', 14, 11, 2006, 'House decides to awaken a comatose patient so he can question the man regarding the family history of his son, who may have a genetic condition and the father is the only living relative. Meanwhile, Wilson confronts House about the stolen prescription pad as Tritter approaches Cameron, Chase, and Foreman in an attempt to divide the team and reveal their loyalties.', 'Y', 'N', 9.1),
	('House MD', 'Whac-A-Mole', 3, 8, 'Yes', 'Yes', 'No', 21, 11, 2006, 'An 18-year-old teenager is brought to the hospital after having a heart attack. House reviews the boy\'s file and believes he has the diagnosis. He then turns the case into a game by sealing his opinion in an envelope and challenging Cameron, Foreman, and Chase to guess House\'s diagnosis on their own. Meanwhile, Tritter\'s actions against Wilson continue to strain the oncologist\'s relationship with House and destroy his ability to practice medicine.', 'Y', 'N', 8.4),
	('House MD', 'Finding Judas', 3, 9, 'Yes', 'Yes', 'No', 28, 11, 2006, 'House takes the case of a young girl who has been diagnosed with pancreatitis. When he takes her divorced parents to court to force them to allow treatment because they can\'t agree, the judge awards guardianship of the girl to Cuddy. Meanwhile, Tritter continues his strategy to force House to admit to his drug use by offering one of the team members a deal.', 'Y', 'N', 8.7),
	('House MD', 'Merry Little Christmas', 3, 10, 'Yes', 'Yes', 'No', 12, 12, 2006, 'Wilson arranges for House to make a deal with Tritter, but House refuses. Meanwhile, Cuddy cuts House off Vicodin and removes him from the team\'s case: a 15-year-old little person who entered the hospital with a collapsed lung and anemia.', 'Y', 'N', 8.9),
	('House MD', 'Words And Deeds', 3, 11, 'Yes', 'Yes', 'No', 9, 1, 2007, 'House splits his time between treating a firefighter for uncontrollable shivering, giving Tritter a piece of his mind, and handling his trial for forging prescriptions.', 'Y', 'N', 8.8),
	('House MD', 'One Day One Room', 3, 12, 'Yes', 'Yes', 'No', 30, 1, 2007, 'While House is forced to work full-time in the clinic and deal with a rape victim who insists on confiding with him, Cameron deals with a terminal cancer patient trying to take advantage of her state of mind.', 'Y', 'N', 9.2),
	('House MD', 'Needle In A Haystack', 3, 13, 'Yes', 'Yes', 'No', 6, 2, 2007, 'House and his staff must deal with a teenage Gypsy boy suffering from inexplicable respiratory distress. However, House has bigger issues on his mind: Cuddy has given away his handicapped spot.', 'Y', 'N', 8.3),
	('House MD', 'Insensitive', 3, 14, 'Yes', 'Yes', 'No', 13, 2, 2007, 'It\'s Valentine\'s Day, and Cuddy has a blind date. Meanwhile, House leaves ER duty to take the case of a child patient named Hannah.', 'Y', 'N', 9),
	('House MD', 'Half-Wit', 3, 15, 'Yes', 'Yes', 'No', 6, 3, 2007, 'House encounters a brain-damaged musical prodigy with inexplicable abilities while the team faces serious concerns about House\'s own health.', 'Y', 'N', 9.2),
	('House MD', 'Top Secret', 3, 16, 'Yes', 'Yes', 'No', 27, 3, 2007, 'The ex-marine that saved House\'s life, in a dream he had the day before, is admitted in the hospital with symptoms resembling Gulf War Syndrome. While House is busy dealing with his own health issues, and Chase and Cameron are too busy with each other, the ex-marine gets worse.', 'Y', 'N', 8.4),
	('House MD', 'Fetal Position', 3, 17, 'Yes', 'Yes', 'No', 3, 4, 2007, 'A famous celebrity photographer suffers from a stroke while being pregnant at her early forties. House and his team have to deal with a great dilemma, save the mother or her unborn child.', 'Y', 'N', 8.6),
	('House MD', 'Airborne', 3, 18, 'Yes', 'Yes', 'No', 10, 4, 2007, 'On House and Cuddy\'s flight from Singapore a passenger gets ill and Cuddy suspects an epidemic. At the hospital, Wilson leads the team as they deal with a middle-aged woman suffering from seizures.', 'Y', 'N', 9.2),
	('House MD', 'Act Your Age', 3, 19, 'Yes', 'Yes', 'No', 17, 4, 2007, 'A 6-year-old girl suffers ailments expected in patients much older. Tensions between Chase and Cameron lead House to intentionally assign them to the same tasks, including investigating the young girl\'s home.', 'Y', 'N', 8.5),
	('House MD', 'House Training', 3, 20, 'Yes', 'Yes', 'No', 24, 4, 2007, 'The doctors try to find what\'s wrong with a scam artist who collapses after her brain \'freezes\', but the case becomes personal for Foreman.', 'Y', 'N', 8.5),
	('House MD', 'Family', 3, 21, 'Yes', 'Yes', 'No', 1, 5, 2007, 'Wilson prepares to transplant bone marrow from Matty to his brother Nick. But when Matty gets sick, the team must cure him as he\'s the only safe donor. Meanwhile Foreman deals with the consequences of his mistake and House has a battle of wills with his new pet Hector.', 'Y', 'N', 8.5),
	('House MD', 'Resignation', 3, 22, 'Yes', 'Yes', 'No', 8, 5, 2007, 'The team deals with a 19-year-old college student, while Foreman suddenly and without a reason hands in his resignation. House seems to have already found Foreman\'s replacement, an attractive nutritionist named Honey.', 'Y', 'N', 8.7),
	('House MD', 'The Jerk', 3, 23, 'Yes', 'Yes', 'No', 15, 5, 2007, 'House treats a 16-year-old chess prodigy who gets everyone on the team annoyed with his behavior. Foreman is upset with House because he thinks his boss sabotaged his job interview with another hospital.', 'Y', 'N', 8.7),
	('House MD', 'Human Error', 3, 24, 'Yes', 'Yes', 'No', 29, 5, 2007, 'A Cuban couple attempt to get to America by raft... to see House about the wife\'s heart condition. But when she gets worse House wonders if someone on his staff messed up. Meanwhile Foreman prepares to leave and his departure threatens to shake up the entire team.', 'Y', 'N', 9.1),
	('House MD', 'Alone', 4, 1, 'Yes', 'Yes', 'Yes', 25, 9, 2007, 'With his diagnostic team gone, House tries to diagnose a young woman who survived an office building collapse. With the condition getting worse, Cuddy puts pressure on House to hire a new team, but instead attempts a differential diagnosis with help from the janitor.', 'Y', 'N', 9.2),
	('House MD', 'The Right Stuff', 4, 2, 'Yes', 'Yes', 'Yes', 2, 10, 2007, 'House is secretly trying to treat a fighter pilot who is a candidate for NASA\'s astronaut training program. Her diagnosis will be the test to choose which ones of the 40 applicants are going to take the empty spots in his team.', 'Y', 'N', 9),
	('House MD', '97 Seconds', 4, 3, 'Yes', 'Yes', 'Yes', 9, 10, 2007, 'The candidates are now two teams of five women and five men, competing on diagnosing and treating a wheelchair-bound man. Meanwhile House does experiments on himself to test what happens after death, and Foreman, at another hospital, is treating his team in a House-like manner.', 'Y', 'N', 8.9),
	('House MD', 'Guardian Angels', 4, 4, 'Yes', 'Yes', 'Yes', 23, 10, 2007, 'House finds that some of his own fellowship students will do whatever it takes, when they deal with a woman who believes she can talk to the dead.', 'Y', 'N', 8.7),
	('House MD', 'Mirror, Mirror', 4, 5, 'Yes', 'Yes', 'Yes', 30, 10, 2007, 'House deals with a patient who mirrors the personality of anyone he meets. Meanwhile, Foreman is put in charge of overseeing the fellowship candidates.', 'Y', 'N', 9),
	('House MD', 'Whatever It Takes', 4, 6, 'Yes', 'Yes', 'Yes', 6, 11, 2007, 'Based on practically no information and no medical history about a mystery patient sent by the CIA, House is using some unorthodox methods to diagnose and treat him. Meanwhile the remaining candidates are questioning Foreman\'s judgment.', 'Y', 'N', 8.8),
	('House MD', 'Ugly', 4, 7, 'Yes', 'Yes', 'Yes', 13, 11, 2007, 'A film crew and the candidates are following around House distracting him while he is trying to diagnose a teenager who suffers from a heart attack prior to a serious plastic surgery.', 'Y', 'N', 8.5),
	('House MD', 'You Don\'t Want To Know', 4, 8, 'Yes', 'Yes', 'Yes', 20, 11, 2007, 'House treats a magician but comes to believe he\'s faking illness to cover up his own incompetence. Meanwhile, House pits the fellows against each other in his version of an immunity challenge.', 'Y', 'N', 8.8),
	('House MD', 'Games', 4, 9, 'Yes', 'Yes', 'Yes', 27, 11, 2007, 'Under Cuddy\'s pressure to choose his team, House gives the candidates a case of a former punk rock star who is a drug user. Whoever diagnoses the patient is going to have a future as a member of House\'s team.', 'Y', 'N', 8.8),
	('House MD', 'It\'s A Wonderful Lie', 4, 10, 'Yes', 'Yes', 'Yes', 29, 1, 2008, 'A mother\'s sudden paralysis during a indoor rock-climbing incident leaves her daughter injured, and House\'s new team looking for a cure. Meanwhile, House organizes his new recruits\' Secret Santa gift exchange... with a few twists of his own.', 'Y', 'N', 8.6),
	('House MD', 'Frozen', 4, 11, 'Yes', 'Yes', 'Yes', 3, 2, 2008, 'House and his team have to diagnose a case at a distance when a researcher at a South Pole base is taken ill.', 'Y', 'N', 9.2),
	('House MD', 'Don\'t Ever Change', 4, 12, 'Yes', 'Yes', 'Yes', 5, 2, 2008, 'House and his team must diagnose a Jewish bride who is taken ill at her wedding. However, House is more interested in analyzing Wilson\'s relationship with his new girlfriend.', 'Y', 'N', 8.4),
	('House MD', 'No More Mr. Nice Guy', 4, 13, 'Yes', 'Yes', 'Yes', 28, 4, 2008, 'House copes with a patient whose symptoms conceal a greater problem, but spends much of his time dodging Cuddy\'s orders to give performance reviews, and fighting with Amber over who gets to spend more time with Wilson.', 'Y', 'N', 8.4),
	('House MD', 'Living The Dream', 4, 14, 'Yes', 'Yes', 'Yes', 5, 5, 2008, 'House is convinced one of the actors on his favorite soap opera has a serious medical condition after observing his symptoms on television. House decides to intervene and take matters into his own hands, but both the actor and House\'s own team dismiss House\'s assessment and do not believe there is anything wrong with him.', 'Y', 'N', 8.5),
	('House MD', 'House\'s Head', 4, 15, 'Yes', 'Yes', 'Yes', 12, 5, 2008, 'A bus accident leaves House with serious head trauma and partial amnesia. He comes to believe that a patient on the bus had a life-threatening disease and struggles to recall who it was, and what they had.', 'Y', 'N', 9.8),
	('House MD', 'Wilson\'s Heart', 4, 16, 'Yes', 'Yes', 'Yes', 19, 5, 2008, 'In the aftermath of the bus accident, House struggles with his head injuries and short-term memory loss, and must deal with a concerned Wilson who believes his friend\'s health may be in danger.', 'Y', 'N', 9.8),
	('House MD', 'Dying Changes Everything', 5, 1, 'Yes', 'Yes', 'No', 16, 9, 2008, 'In the aftermath of personal tragedy, Wilson resigns from the hospital... and from his friendship with House. Meanwhile, Thirteen struggles with her personal medical problems while helping treat an executive assistant with a similar situation to her own.', 'Y', 'N', 8.6),
	('House MD', 'Not Cancer', 5, 2, 'Yes', 'Yes', 'No', 23, 9, 2008, 'The team deals with an organ donor whose organs prove fatal, and the two surviving patients. Meanwhile, House hires a private detective to spy on Wilson, but hears a few things about himself that he\'d rather not. ', 'Y', 'N', 8.5),
	('House MD', 'Adverse Events', 5, 3, 'Yes', 'Yes', 'No', 30, 9, 2008, 'A painter\'s undiagnosed illness affects his work, and House and his team must look at the man\'s paintings to determine what\'s wrong with him.', 'Y', 'N', 8.5),
	('House MD', 'Birthmarks', 5, 4, 'Yes', 'Yes', 'No', 14, 10, 2008, 'While en route to his father\'s funeral, House must help the team with a differential diagnosis on a young Chinese girl who has collapsed under mysterious circumstances.', 'Y', 'N', 9.1),
	('House MD', 'Lucky Thirteen', 5, 5, 'Yes', 'Yes', 'No', 21, 10, 2008, 'Thirteen brings her one-night stand to the hospital after the woman has a seizure. However, the woman admits she slept with Thirteen just so she could get to House and have him diagnose her condition. Meanwhile, House continues to pay Lucas to spy on Wilson.', 'Y', 'N', 8.8),
	('House MD', 'Joy', 5, 6, 'Yes', 'Yes', 'No', 28, 10, 2008, 'An ailing man suffers from blackouts and sleepwalks, leading the team to wonder if his sleepwalking is a symptom, or how the man is becoming exposed to something else. When the man\'s daughter grows ill as well, the team must provide a diagnosis before both die. Meanwhile, Cuddy adopts a newborn but when the birth mother displays a rash, she has to make a decision between putting the mother or daughter at risk.', 'Y', 'N', 8.8),
	('House MD', 'The Itch', 5, 7, 'Yes', 'Yes', 'No', 11, 11, 2008, 'The team must treat an agoraphobic who refuses to leave his house, and have to work around Cuddy, who is less than thrilled at having hospital equipment relocated. Meanwhile, House is plagued by an itch, and Cameron and Chase have relationship issues.', 'Y', 'N', 8.5),
	('House MD', 'Emancipation', 5, 8, 'Yes', 'Yes', 'No', 18, 11, 2008, 'While Foreman takes on a pediatric case on his own, the rest of the team deals with a 16-year-old factory manager and emancipated minor who collapses at work. When Foreman\'s patient takes a turn for the worse, he\'s forced to question whether he can deal with the situation on his own, or if he needs House\'s help.', 'Y', 'N', 8.3),
	('House MD', 'Last Resort', 5, 9, 'Yes', 'Yes', 'No', 25, 11, 2008, 'A man seeking the right diagnosis for his illness is willing to take on the hospital and the SWAT team to get it. He takes thirteen and several patients from the waiting room and puts them in Cuddy\'s office. To put an end to the crisis they must come up with the right diagnosis, treat the wounded, and hold off a SWAT team. ', 'Y', 'N', 9),
	('House MD', 'Let Them Eat Cake', 5, 10, 'Yes', 'Yes', 'No', 2, 12, 2008, 'The team takes on the case of a fitness guru on an all-natural diet who collapsed while filming a video. Meanwhile, Foreman conducts Huntington\'s Disease drug trials and Thirteen signs on as a subject, Cuddy is forced to move into House\'s office, and Kutner uses House\'s name to run an online medical-advice website.', 'Y', 'N', 8.5),
	('House MD', 'Joy To The World', 5, 11, 'Yes', 'Yes', 'No', 9, 12, 2008, 'House and his team deal with a bullied girl who collapses during her school\'s Christmas program. Meanwhile, Foreman and Thirteen grow closer during the Huntington\'s disease drug trials, House gives a patient a gift, the staff wonder who gave House a special gift, and Cuddy gets an unexpected gift.', 'Y', 'N', 8.6),
	('House MD', 'Painless', 5, 12, 'Yes', 'Yes', 'No', 19, 1, 2009, 'House and the team try to diagnose a man living with severe, chronic pain; Thirteen and Foreman explore their complicated relationship; Cuddy discovers that caring for her baby leaves her with little time to run the hospital.', 'Y', 'N', 8.3),
	('House MD', 'Big Baby', 5, 13, 'Yes', 'Yes', 'No', 26, 1, 2009, 'Cuddy decides to spend more time at home to take care of her newly adopted baby and passes some of her day-to-day responsibilities off to Cameron, including supervising House. Cameron is forced to play House\'s games and becomes involved in a power struggle as he and the team take on the case of a Special Education teacher who collapsed after spitting up blood in the middle of class. As House tests Cameron\'s tolerance for his extreme measures, the patient continues to fall ill and House insists the teacher\'s seemingly inherent goodness is actually a pathology.', 'Y', 'N', 8.3),
	('House MD', 'The Greater Good', 5, 14, 'Yes', 'Yes', 'No', 2, 2, 2009, 'House and the team take on the case of a woman who collapsed in the middle of a cooking class, and they soon learn she is a highly-renowned cancer researcher who recently gave up her entire career in order to pursue her own personal happiness. Though the team struggles to understand how the woman could give up saving lives for the sake of her own contentment, each grapple with the pursuit of happiness (or lack thereof) in their own lives. As the patient\'s condition continues to worsen, so does Thirteen\'s as she begins to suffer serious and life-threatening reactions to the experimental Huntington\'s Disease clinical trial. Meanwhile, Cuddy attempts to make House\'s life miserable for him in retaliation for his part in her own unhappiness.', 'Y', 'N', 8.3),
	('House MD', 'Unfaithful', 5, 15, 'Yes', 'Yes', 'No', 16, 2, 2009, 'When a priest who runs a homeless shelter sees a bleeding Jesus hovering at his doorstep, he is admitted to the ER. House takes on the case as a distraction for the team while he confronts Foreman and Thirteen about their relationship. The team soon learns the priest had been involved in a molestation scandal that caused him to lose his faith. However, just as they are about to dismiss his case, the patient\'s condition takes a drastic turn for the worse, and House grapples with his past and his belief', 'Y', 'N', 8.7),
	('House MD', 'The Softer Side', 5, 16, 'Yes', 'Yes', 'No', 23, 2, 2009, 'A patient with both male and female DNA has the team stumped. Meanwhile, House starts acting nicely, raising Cuddy\'s and Wilson\'s suspicions that something is terribly wrong.', 'Y', 'N', 8.7),
	('House MD', 'The Social Contract', 5, 17, 'Yes', 'Yes', 'No', 9, 3, 2009, 'House and the team take on the case of Nick, a book editor who loses his inhibitions. The team realizes Nick has frontal lobe disinhibition, which causes him to speak his mind having no control over what he says and making him just like House. Meanwhile, House suspects Wilson and Taub are keeping something from him.', 'Y', 'N', 8.9),
	('House MD', 'Here Kitty', 5, 18, 'Yes', 'Yes', 'No', 16, 3, 2009, 'Morgan works in a nursing home with a pet cat who only sleeps next to people if they are about to die - and does so with alarmingly accuracy. When it seems the cat has predicted her own death, Morgan, convinced she is about to die, fakes a seizure in order to get to House to have him diagnose her before it\'s too late. ', 'Y', 'N', 8.5),
	('House MD', 'Locked In', 5, 19, 'Yes', 'Yes', 'No', 30, 3, 2009, 'A man awakens in New York after a bicycle accident unable to move or communicate in any way. House, himself injured in a motorcycle mishap, occupies the hospital bed next to Lee and quickly annoys the doctors treating them both by insisting that Lee has \'locked-in\' syndrome.', 'Y', 'N', 9.2),
	('House MD', 'Simple Explanation', 5, 20, 'Yes', 'Yes', 'No', 6, 4, 2009, 'Charlotte, an older woman who has spent the last six months taking care of her dying husband Eddie, is rushed to Princeton Plainsboro after collapsing from respiratory failure. The couple becomes a double mystery for the team when Eddie begins to improve as Charlotte\'s condition worsens. The previously unthinkable becomes real when it seems that Charlotte will die before Eddie, and the team will be forced to make a difficult decision.', 'Y', 'N', 9.3),
	('House MD', 'Saviors', 5, 21, 'Yes', 'Yes', 'No', 13, 4, 2009, 'Cameron postpones her vacation with Chase in order to ask House to accept the case of an environmental radical who collapsed at a protest with unexplainable symptoms. Although suspicious of her motives, House agrees. Since she pushed him to take the case so emphatically, House forces Cameron to take the lead and run many of the tests on the patient. Meanwhile, House is unsure of Wilson\'s new healthy diet.', 'Y', 'N', 8.7),
	('House MD', 'House Divided', 5, 22, 'Yes', 'Yes', 'No', 27, 4, 2009, 'The team takes on the case of a deaf 14-year-old named Seth who collapsed after he started \'hearing\' explosions while competing in a wrestling match. When the team tries to test him for seizures, Seth loses vision in one eye, complicating House\'s bunk theory of \'Exploding Head Syndrome\'. As his condition worsens, the team has an ethical disagreement about the patient and his mother\'s adamant decision to forego cochlear implants to supplement his hearing. When the prospect of giving Seth the ability to hear for the first time in his life arises, House and the team are faced with a resounding decision. Meanwhile, House\'s lack of sleep starts to play tricks on his mind, but he finds his insomnia may be a gift instead of a burden.', 'Y', 'N', 9.3),
	('House MD', 'Under My Skin', 5, 23, 'Yes', 'Yes', 'No', 4, 5, 2009, 'House and the team take on the case of a ballerina whose lungs collapse in the middle of a performance. When the treatment causes her skin to fall off, the dancer faces not only the prospect of never dancing again but also of dying an agonizing death. The team must use their imaginations to carefully choreograph ways to test and treat her delicate body without killing her. Meanwhile, House continues to suffer from what he thinks is insomnia, and he is willing to go to desperate measures to cure it.', 'Y', 'N', 9.3),
	('House MD', 'Both Sides Now', 5, 24, 'Yes', 'Yes', 'No', 11, 5, 2009, 'House and the team are intrigued by Scott, a man whose left brain and right brain operate independently, leaving him with two distinct personalities and no control over some of his actions. As the two sides of Scott\'s brain struggle for dominance, his warring personalities make it increasingly difficult for the team to figure out what is causing the unique problem. The team is forced to use some unusual methods to get him to cooperate with their necessary testing. Meanwhile, when House refuses to make an appearance in the clinic, Cuddy takes an unconventional approach to force House to make up the time with a particular patient.', 'Y', 'N', 9.7),
	('House MD', 'Broken - 1', 6, 1, 'Yes', 'Yes', 'No', 21, 9, 2009, 'House engages in a battle of wits and wills against the attending physician in charge of his detox program. When he starts to lose, House resorts to blackmail to gain the upper hand.', 'Y', 'N', 9.7),
	('House MD', 'Broken - 2', 6, 2, 'Yes', 'Yes', 'No', 21, 9, 2009, 'House engages in a battle of wits and wills against the attending physician in charge of his detox program. When he starts to lose, House resorts to blackmail to gain the upper hand.', 'Y', 'N', 9.7),
	('House MD', 'Epic Fail', 6, 3, 'Yes', 'Yes', 'No', 28, 9, 2009, 'House returns home to Princeton where he continues to focus on his recovery, but surprises Cuddy with the news that he\'s making a big change in his life. Meanwhile, the team is unable to diagnose a loud-mouthed video game creator who posts each new symptom on the internet and opts for treatments suggested by the online community rather than by the doctors, and Foreman angles for House\'s job, but the pressure to solve the case creates tension in his relationship with Thirteen.', 'Y', 'N', 8.8),
	('House MD', 'The Tyrant', 6, 4, 'Yes', 'Yes', 'No', 5, 10, 2009, 'When a controversial African politician falls ill, he is brought to Princeton Plainsboro for treatment. The team struggles with whether to help a merciless dictator being subpoenaed for crimes against humanity in his country. Meanwhile, Wilson tries to make peace with a feuding neighbor, but House\'s prying exacerbates the problem.', 'Y', 'N', 9.1),
	('House MD', 'Instant Karma', 6, 5, 'Yes', 'Yes', 'No', 12, 10, 2009, 'A wealthy businessman brings his teenage son, who is suffering from inexplicable stomach pains, to Princeton Plainsboro and insists on having Dr. House handle the case. The father of the patient believes the karmic penalty of his financial success is that he is victim to personal tragedy, and that the answer to his son\'s medical mystery lies in a reverse of fate rather than medical treatment. Meanwhile, Foreman and Chase prepare to present information on the Dibala case.', 'Y', 'N', 8.7),
	('House MD', 'Brave Heart', 6, 6, 'Yes', 'Yes', 'No', 19, 10, 2009, 'A dying patient insists that he has the same disease affecting his heart that killed his father and grandfather at the age of 40. Meanwhile, House discovers that he has a hearing problem while trying to duck student rounds.', 'Y', 'N', 8.7),
	('House MD', 'Known Unknowns', 6, 7, 'Yes', 'Yes', 'No', 9, 11, 2009, 'After a wild night out, a teenage girl is brought to Princeton Plainsborough with severely swollen appendages. The team must work to diagnose the young girl, who is less than honest about what happened the night she fell ill. As her condition worsens, she becomes unable to distinguish fact from fiction. Meanwhile, Cuddy, Wilson and House spend a weekend away from the hospital to attend a medical conference, but things don\'t go as planned when House\'s private investigator, Lucas returns.', 'Y', 'N', 8.6),
	('House MD', 'Teamwork', 6, 8, 'Yes', 'Yes', 'No', 16, 11, 2009, 'After House\'s medical license is reinstated, he reclaims his role as Head of Diagnostics in time to treat Hank Hardwick, an adult film star admitted to Princeton Plainsborough for pulsating eye pain. Meanwhile, Cuddy is reminded that Princeton Plainsborough is not conducive to healthy personal relationships.', 'Y', 'N', 8.5),
	('House MD', 'Ignorance Is Bliss', 6, 9, 'Yes', 'Yes', 'No', 23, 11, 2009, 'On the eve of Thanksgiving, House and the team take on the case of James Sidas, an exceptionally brilliant physicist and author who traded his successful career for a job as a courier. For the ailing patient, intelligence is a miserable burden that has prompted depression and addiction, and this, coupled with a myriad of strange symptoms, nearly stumps the team. Meanwhile the doctors at Princeton Plainsboro wrestle with strained personal relationships.', 'Y', 'N', 8.6),
	('House MD', 'Wilson', 6, 10, 'Yes', 'Yes', 'No', 30, 11, 2009, 'When an old friend and former patient of Wilson\'s exhibits paralysis in his right arm, Wilson puts himself on the case. House wagers Wilson that the patient\'s symptoms are attributed to new cancer cells. Wilson accepts even though he is reluctant to believe the cancer has returned. With the help of the team, Wilson works to diagnose the patient more optimistic results, but when things take a turn for the worse, Wilson must address his inability to separate patient from friend. Meanwhile, Cuddy seeks advice in her search for real estate.', 'Y', 'N', 9.1),
	('House MD', 'The Down Low', 6, 11, 'Yes', 'Yes', 'No', 11, 1, 2010, 'When drug dealer Mickey mysteriously collapses while negotiating a sale, his partner-in-crime, Eddie, accompanies him to Princeton Plainsboro for treatment. But with a major deal pending, Mickey is not forthcoming with the necessary personal information the team needs to treat him. As Mickey\'s condition worsens, the team resorts to old-fashioned detective work to solve the case. Meanwhile, House and Wilson compete for the affection of a new neighbor, and Chase, Thirteen and Taub attempt to play a practical joke on Foreman.', 'Y', 'N', 9.1),
	('House MD', 'Remorse', 6, 12, 'Yes', 'Yes', 'No', 25, 1, 2010, 'The team takes on the case of Valerie, an attractive female executive experiencing random episodes of excruciating pain. House agrees to take the case based on Valerie\'s looks, and while treating her, the men on the team are charmed by Valerie\'s beauty and personality, with Thirteen looking beyond the superficial to try to discover a link to her illness. Meanwhile, House uncharacteristically attempts to alleviate his conscience by reaching out to a former medical school colleague he wronged.', 'Y', 'N', 8.9),
	('House MD', 'Moving The Chains', 6, 13, 'Yes', 'Yes', 'No', 1, 2, 2010, 'House and the team rush to treat an ailing college football star in time for the patient to compete in NFL tryouts. But when the patient experiences an onslaught of varied and unusual symptoms, the team has trouble reaching a consensus on how to effectively treat him in time. Meanwhile, Foreman\'s brother Marcus makes a surprise visit to the hospital.', 'Y', 'N', 8.2),
	('House MD', '5 To 9', 6, 14, 'Yes', 'Yes', 'No', 8, 2, 2010, 'During a day in the life of Princeton Plainsboro\'s Dean of Medicine, Dr. Lisa Cuddy, the inner workings of the hospital are seen through her eyes. This day proves to be especially trying as Cuddy wrestles with myriad hospital issues and staff disputes that test her perseverance and skills as an administrator, all while juggling issues in her personal life.', 'Y', 'N', 8.5),
	('House MD', 'Private Lives', 6, 15, 'Yes', 'Yes', 'No', 8, 3, 2010, 'House and the team take on the case of an avid blogger admitted with sudden bruising and bleeding. From her hospital bed, the patient blogs about her symptoms, doctors and prospective diagnoses to her dedicated band of followers and solicits their advice on a course of treatment. Such openness leads the team to contemplate the value of privacy, especially after House and Wilson uncover secrets from one another \'s past. Meanwhile, Chase is coaxed into testing out the dating scene.', 'Y', 'N', 8.3),
	('House MD', 'Black Hole', 6, 16, 'Yes', 'Yes', 'No', 15, 3, 2010, 'The team takes on the case of a high school senior who inexplicably blacks out during a class field trip. While in the hospital, the patient repeatedly hallucinates. After exhausting myriad ineffective treatments for her mysterious ailments, House attempts one last controversial approach to diagnosing her: monitoring her cognitive patterns and looking for clues. Meanwhile, Taub airs his dirty laundry at work, and Wilson attempts to furnish his condo.', 'Y', 'N', 8.3),
	('House MD', 'Lockdown', 6, 17, 'Yes', 'Yes', 'No', 12, 4, 2010, 'When a newborn disappears from the nursery, Princeton Plainsboro goes on lockdown, preventing anyone from entering, leaving or moving within the hospital. While House and his team members are trapped in various parts of the building, new insights about the team\'s personal histories, relationships and regrets surface.', 'Y', 'N', 8.9),
	('House MD', 'Knight Fall', 6, 18, 'Yes', 'Yes', 'No', 19, 4, 2010, 'House and the team take on the case of Sir William, a \'knight\' in a closed-off community of men and women living according to the ideals of the High Renaissance. As the team searches the medieval village for environmental factors contributing to Sir William\'s rapidly deteriorating health, Thirteen and Sir William debate the acts that define honor and loyalty, especially in regard to the \'queen\' of the community, one of Sir William\'s most frequent visitors. Meanwhile, Wilson starts over with an ex.', 'Y', 'N', 8.2),
	('House MD', 'Open And Shut', 6, 19, 'Yes', 'Yes', 'No', 26, 4, 2010, 'House and the team take on the case of a woman Julia, who is in an open marriage and becomes ill during a date with her on-the-side boyfriend. As perplexing as the case is, Julia\'s happy and healthy, yet polygamous relationship is equally baffling to the team. Meanwhile, House tests Wilson\'s relationship with Sam.', 'Y', 'N', 8.2),
	('House MD', 'The Choice', 6, 20, 'Yes', 'Yes', 'No', 3, 5, 2010, 'The team takes on the case of an ailing groom-to-be who harbors undisclosed secrets from a previous relationship. As his fiance tries to get answers to her many questions, a frustrated team winnows down the possibilities. Meanwhile, House spends extra-curricular time with his Princeton Plainsboro colleagues, performing a karaoke rendition of a Gladys Knight & The Pips classic with Foreman and Chase.', 'Y', 'N', 8.5),
	('House MD', 'Baggage', 6, 21, 'Yes', 'Yes', 'No', 10, 5, 2010, 'During a session with Dr. Nolan, House recounts the case of a woman who arrives at the Princeton Plainsboro emergency room with an unexplained illness and no recollection of who she is. While trying to solve the mystery of the woman\'s illness, House must also help her piece together her identity.', 'Y', 'N', 9.1),
	('House MD', 'Help Me', 6, 22, 'Yes', 'Yes', 'No', 17, 5, 2010, 'Cuddy, House and members of the team join forces with a search-and-rescue team to provide much-needed medical attention at the scene of an emergency.', 'Y', 'N', 9.6),
	('House MD', 'Now What', 7, 1, 'Yes', 'Yes', 'No', 20, 9, 2010, 'House and Cuddy are exploring the ramifications of those feelings and attempting to make a real relationship work. Meanwhile, due to a colleague\'s illness, Princeton Plainsboro is left without a neurosurgeon on site, threatening the hospital\'s accreditation as a Level 1 Trauma Center. As the team attempts treatment to get their sick colleague back to work, they discover there is more to the illness than they originally suspected and turn to House for direction. Instead, House remains elusive, leaving the team on its own.', 'Y', 'N', 8.5),
	('House MD', 'Selfish', 7, 2, 'Yes', 'Yes', 'No', 27, 9, 2010, 'A seemingly healthy 14-year-old girl collapses during a skateboarding exhibition. House and Cuddy face the challenge of handling their romantic relationship at work.', 'Y', 'N', 8.8),
	('House MD', 'Unwritten', 7, 3, 'Yes', 'Yes', 'No', 4, 10, 2010, 'A children\'s novelist tries to kill herself, but is thwarted when she has a seizure. House, a fan of the books, puts her on psych hold but has to deal with a patient that is eager to die rather than be cured. Meanwhile, House worries that he\'ll lose Cuddy because they have nothing in common.', 'Y', 'N', 8.5),
	('House MD', 'Massage Therapy', 7, 4, 'Yes', 'Yes', 'No', 11, 10, 2010, 'House and his team make unexpected discoveries about a female patient admitted to the hospital after severe and uncontrollable vomiting. House and Cuddy are forced to face the reservations in their relationship after a visit from a massage therapist.', 'Y', 'N', 8.2),
	('House MD', 'Unplanned Parenthood', 7, 5, 'Yes', 'Yes', 'No', 18, 10, 2010, 'When an infant suffers breathing trouble and liver failure, House and the team must look at the medical history of the mother in order to find an answer, and ultimately land on a discovery that forces the mother to jeopardize not only her child\'s health but her own. Meanwhile Taub and Foreman must find a new female doctor to fill the spot vacated by Thirteen and House and Wilson learn a thing or two about parenting while caring for Cuddy\'s daughter. ', 'Y', 'N', 8.5),
	('House MD', 'Office Politics', 7, 6, 'Yes', 'Yes', 'No', 8, 11, 2010, 'It\'s election season, and in the midst of a tight campaign, an incumbent New Jersey senator\'s campaign manager falls ill with liver failure and temporary paralysis. Cuddy pushes House to add a female doctor to his team by hiring brilliant third-year medical student Martha Masters in Thirteen\'s absence. House and the team are wary of the young doctor\'s lack of experience and medical perspective, but are forced to give their new by-the-book teammate a chance to prove herself. After the campaigning senator makes a surprising announcement, House and the team look to the candidate to find clues about the patient\'s condition. Meanwhile, Foreman learns that Taub has a past connection to Masters, and in an effort to save his patient\'s life, House must make a critical decision that may compromise his relationship with Cuddy.', 'Y', 'N', 8.4),
	('House MD', 'A Pox On Our House', 7, 7, 'Yes', 'Yes', 'No', 15, 11, 2010, 'After a 200-year-old medicine jar found on an off-shore shipwreck shatters in a teenage girl\'s palm, she is admitted to Princeton Plainsboro for symptoms closely linked to smallpox. When the Center for Disease Control\'s Dr. Dave Broda institutes a lockdown on the hospital and suspends House\'s team\'s ability to diagnose, Masters grows suspicious of Broda\'s motives and becomes convinced that the patient is suffering from a different disease. The girl\'s father soon experiences similar symptoms, and House is forced to make a precarious decision that puts his own life in jeopardy. Meanwhile, Wilson and Sam comfort a 6-year-old chemotherapy patient who prompts them to examine their relationship.', 'Y', 'N', 8.8),
	('House MD', 'Small Sacrifices', 7, 8, 'Yes', 'Yes', 'No', 22, 11, 2010, 'Science and faith are called into question when a patient is admitted to the hospital following his reenactment of the Crucifixion. Meanwhile, Taub questions his wife, Rachel, about her relationship with an infidelity support group member, and the team attends a co-worker\'s wedding where Wilson\'s relationship with Sam takes an unexpected turn. ', 'Y', 'N', 8.1),
	('House MD', 'Larger Than Life', 7, 9, 'Yes', 'Yes', 'No', 17, 1, 2011, 'After saving a stranger who fell onto subway tracks, a man suddenly collapses despite appearing to be unscathed; House tries to avoid a dinner with Cuddy and her opinionated mother.', 'Y', 'N', 8.7),
	('House MD', 'Carrot Or Stick', 7, 10, 'Yes', 'Yes', 'No', 24, 1, 2011, 'House and the team try to link symptoms of a teenage military recruit and his drill sergeant. House secretly helps Cuddy\'s daughter get into a prestigious preschool, someone posted a disparaging photo of Chase on a social-networking site. ', 'Y', 'N', 8.3),
	('House MD', 'Family Practice', 7, 11, 'Yes', 'Yes', 'No', 7, 2, 2011, 'Cuddy\'s mother, Arlene, is admitted to Princeton Plansboro after complaining about unusual symptoms, but stubborn Arlene insists that House be removed from the case, forcing House to come up with non-conventional and illegal means to treat his patient. House instructs his team to follow his lead, and they discover details in Arlene\'s personal life that she kept secret from Cuddy and her sister Lucinda. Meanwhile, Taub\'s ex-wife, Rachel, puts him in contact with her brother who hires Taub to work a job on the side in exchange for much-needed income, which winds up taking a physical and emotional toll on him. Later, Cuddy places her trust in House to ensure that her mother receives the proper medical treatment, leading by the book medical student Masters to reevaluate her responsibility to practice within a code of ethics and to follow her boss\'s orders.', 'Y', 'N', 8.8),
	('House MD', 'You Must Remember This', 7, 12, 'Yes', 'Yes', 'No', 14, 2, 2011, 'When a waitress with a perfect memory suffers temporary paralysis, her older sister visits her in the hospital, which triggers high stress levels and even more health complications. The patient\'s sharp memory proves detrimental when a grudge she\'s been holding against her sibling gets in the way of receiving proper medical treatment, and Masters discovers that patching a broken sisterhood may prove to be more complex than diagnosing the patient. Meanwhile, Foreman volunteers to help Taub prepare for a medical examination, while House, determined to help Wilson get back in the dating scene, discovers Wilson\'s secret new companion.', 'Y', 'N', 8.1),
	('House MD', 'Two Stories', 7, 13, 'Yes', 'Yes', 'No', 21, 2, 2011, 'House participates in a school\'s Career Day and breaks a few rules by sharing explicit medical stories. Waiting outside the principal\'s office, he meets two fifth-grade students who assess House\'s relationship woes and try to help him understand how his selfish antics get in the way of showing Cuddy how he really feels.', 'Y', 'N', 9.1),
	('House MD', 'Recession Proof', 7, 14, 'Yes', 'Yes', 'No', 28, 2, 2011, 'A patient is admitted after breaking out in a severe rash triggered by caustic chemical exposure at his blue-collar job. As the team treats him, they discover that he has led his wife to believe that he is still maintaining his once-lucrative real estate career. Meanwhile, Cuddy is honored with an award and needs House to be at the charity event for support, but his attendance is threatened when his patient\'s battle to survive forces him to question his practice and his own happiness, and Chase and Masters teach each other a lesson in forging meaningful personal and professional relationships.', 'Y', 'N', 8.1),
	('House MD', 'Bombshells', 7, 15, 'Yes', 'Yes', 'No', 7, 3, 2011, 'Tension reaches new heights when Cuddy faces sobering news that propels her to reevaluate her priorities. While House is distracted by his concern for Cuddy\'s well-being, the team treats a teenage patient whose worsening symptoms and suspicious body scars indicate more than just physical illness. Sensing the teen\'s troubled emotional and mental state, Taub turns to the patient\'s personal life for clues and uncovers disturbing home videos that could put the lives of his peers in danger. Meanwhile, Cuddy remains hopeful that House will be fully present when she needs him most, and a series of dreams, including a musical scene choreographed by Mia Michaels, provide glimpses into her life and her relationship with House.', 'Y', 'N', 8.8),
	('House MD', 'Out Of The Chute', 7, 16, 'Yes', 'Yes', 'No', 14, 3, 2011, 'The team treats a professional bull rider who is attacked by a bull. The team must determine the causes behind the patients disappearing symptoms and seizures while taking House\'s advice from outside the hospital as he attends to issues unrelated to the case. Meanwhile, Masters develops a crush on the patient.', 'Y', 'N', 9.1),
	('House MD', 'Fall From Grace', 7, 17, 'Yes', 'Yes', 'No', 21, 3, 2011, 'A homeless man with a history of drug abuse is admitted to Princeton Plainsboro with burns and scars on his chest. Meanwhile, Cuddy reveals her guilt to Wilson about breaking up with House.', 'Y', 'N', 8.6),
	('House MD', 'The Dig', 7, 18, 'Yes', 'Yes', 'No', 11, 4, 2011, 'Thirteen has been in prison for the past year, but the real mystery for House is what she did to get there. At the hospital, the team treats a science teacher suffering from severe respiratory illness. Taub tries to get back into the dating scene, but winds up retreating to his old habits.', 'Y', 'N', 9.1),
	('House MD', 'Last Temptation', 7, 19, 'Yes', 'Yes', 'No', 18, 4, 2011, 'Masters faces a career crossroads on her last day as a medical student and struggles with the choice to continue on the path to become a surgeon or to accept the rare opportunity to join House\'s team officially. Meanwhile, the team treats a 16-year-old girl who inexplicably collapsed days before embarking on an ambitious sailing tour around the globe. Despite the patient\'s life-changing diagnosis, the patient\'s family insists on getting her back on the seas in time for her potentially record-breaking launch. But to the team\'s surprise, including House, Masters makes a bold decision regarding the patient\'s treatment.', 'Y', 'N', 8.7),
	('House MD', 'Changes', 7, 20, 'Yes', 'Yes', 'No', 2, 5, 2011, 'The team takes on the case of a lottery winner suffering from paralysis and multiple types of cancer, and they must figure out if it his new millionaire lifestyle that is making him sick. Meanwhile, Cuddy\'s mother threatens to sue the hospital over her treatment, and Foreman and Chase make a bet over who is repressing the uglier side of their personality more.', 'Y', 'N', 8.2),
	('House MD', 'The Fix', 7, 21, 'Yes', 'Yes', 'No', 9, 5, 2011, 'After losing a bet with Wilson over a boxing match, House is convinced that his fighter has an underlying medical condition that cost him the fight. While he tries to prove it, he leaves his team alone to help a bomb scientist who suffered a seizure. Meanwhile, House may be experimenting with a new drug to help his leg pain.', 'Y', 'N', 8.1),
	('House MD', 'After Hours', 7, 22, 'Yes', 'Yes', 'No', 16, 5, 2011, 'When House discovers that the experimental drug he\'s been using causes fatal tumors, he decides to attempt to excise them himself. However, he can\'t complete the surgery and ends up needing Cuddy\'s help. Meanwhile, Thirteen\'s friend from prison , a relapsed drug user, arrives at her apartment needing medical care after being stabbed. With her friend unwilling to go to the hospital, Thirteen enlists Chase\'s assistance when the friend loses sensation and movement in her arm. Also, Taub receives some unexpected news that could change his life.', 'Y', 'N', 9.2),
	('House MD', 'Moving On', 7, 23, 'Yes', 'Yes', 'No', 23, 5, 2011, 'The team treats a performance artist who deliberately made herself ill with the aim of turning the diagnostics department into her new masterpiece, as House must decide which of her symptoms are real, and which are self-inflicted. As the case progresses, House vows to make changes in his life, but remains rooted in old habits. After the case is over, House finally deals with his anger over the breakup and lashes out by driving through Cuddy\'s dining room and escaping to a beach.', 'Y', 'N', 8.6),
	('House MD', 'Twenty Vicodin', 8, 1, 'Yes', 'Yes', 'No', 3, 10, 2011, 'House is serving out a lengthy prison sentence for his various misdeeds, including his trip outside the country in an attempt to escape responsibility. Entirely cut off from his old life, House determines his current problems are the result of his inability to deal with people. Feeling he will never be able to practice medicine again, he plans instead to go back to university to earn a doctorate in physics - a field that will all but assure his isolation from other human beings.', 'Y', 'N', 8.9),
	('House MD', 'Transplant', 8, 2, 'Yes', 'Yes', 'No', 10, 10, 2011, 'A surprising visitor makes House an offer he can\'t refuse by giving him the opportunity to help the Princeton Plainsboro team treat a unique patient in order to save the life of an organ recipient being treated by Wilson. Although House finds himself back on familiar ground, he quickly realizes that much has changed since he left, and he is forced to work on the case with smart yet timid resident Dr. Chi Park. After several inconclusive treatments and with time running out, House and Dr. Park are left with one last option to examine the patient\'s medical history that could compromise House\'s conditional agreement with the hospital. Meanwhile, House makes an effort to reconnect with Wilson despite a cold reception.', 'Y', 'N', 8.4),
	('House MD', 'Charity Case', 8, 3, 'Yes', 'Yes', 'No', 17, 10, 2011, 'House and Park treat a patient, Benjamin, who collapsed after making a surprisingly large charity donation, and come to suspect that the altruistic behavior is a symptom of a deeper disorder. When the patient offers to donate an organ for another patient, the doctors must convince Dr. Adams to help them confirm whether Benjamin is in his right mind or not.', 'Y', 'N', 8.5),
	('House MD', 'Risky Business', 8, 4, 'Yes', 'Yes', 'No', 31, 10, 2011, 'A CEO falls mysteriously ill just days before he signs a contract that would relocate his company\'s entire labor force to China. House attempts to make an underhanded business transaction with his wealthy patient, but when the patient\'s condition worsens, the team must work around the clock to save his life. Meanwhile, Park prepares for her hearing with the Princeton Plainsboro Disciplinary Committee chaired by Foreman, and Adams\' outlook on her patient\'s business venture reveals her deeper feelings about loyalty.', 'Y', 'N', 8.2),
	('House MD', 'The Confession', 8, 5, 'Yes', 'Yes', 'No', 7, 11, 2011, 'A man well-respected in his community suddenly collapses, and in the process of diagnosing his symptoms, the team discovers that the patient has been hiding dark and dishonest secrets about his personal and professional life. But when the patient openly confesses his wrongdoings to his family and community, he compromises his chances of receiving the proper medical treatment. Meanwhile, House will stop at nothing to manipulate Taub into taking a DNA test to prove he is the father of his two six-month-old daughters.', 'Y', 'N', 8.7),
	('House MD', 'Parents', 8, 6, 'Yes', 'Yes', 'No', 14, 11, 2011, 'A teenage boy attempting to follow in his late father\'s footsteps as an entertainer is admitted to Princeton Plainsboro with partial paralysis. As the team searches for a bone marrow match, they uncover a disturbing family secret. Meanwhile, House looks for creative ways to remove his ankle monitor so that he can attend a boxing match in Atlantic City, and he treats a patient who is convinced he is suffering from diabetes. Also, Taub faces a tough decision when his ex-wife Rachel tells him that she wants to move across the country with their infant daughter. ', 'Y', 'N', 8.2),
	('House MD', 'Dead & Buried', 8, 7, 'Yes', 'Yes', 'No', 21, 11, 2011, 'The team learns that their 14-year-old patient is suffering from more than teen angst when her physical symptoms worsen. Despite Foreman\'s firm opposition, House becomes obsessed with solving a peculiar case of a deceased four-year-old patient, which gets him into serious trouble. Meanwhile, Park tries to get Chase to admit the reason behind his recent obsession with grooming.', 'Y', 'N', 8.4),
	('House MD', 'Perils Of Paranoia', 8, 8, 'Yes', 'Yes', 'No', 28, 11, 2011, 'A prosecutor suffers from what he believes to be cardiac arrest during an interrogation at the witness stand. The team\'s preliminary diagnosis is hyper-anxiety, but when Adams and Park investigate the patient\'s home and find a hidden arsenal of firearms, they uncover a more alarming and deep-seated psychological disorder.', 'Y', 'N', 8.2),
	('House MD', 'Better Half', 8, 9, 'Yes', 'Yes', 'No', 23, 1, 2012, 'House and his team treat an Alzheimer\'s patient who vomits blood and flies into violent rages. Meanwhile, when Wilson tells House about a patient who has never had sex with her husband of 10 years, claiming A-sexuality, House makes a wager with him that there has to be an underlying cause.', 'Y', 'N', 8.4),
	('House MD', 'Runaways', 8, 10, 'Yes', 'Yes', 'No', 30, 1, 2012, 'When a runaway teen requires hospitalization, Adams butts heads with House when she insists they contact Social Services. Meanwhile, Taub has trouble forming a personal connection with his baby daughters and Foreman\'s relationship with a married woman comes out.', 'Y', 'N', 8),
	('House MD', 'Nobody\'s Fault', 8, 11, 'Yes', 'Yes', 'No', 6, 2, 2012, 'House and his team are placed under review after a staff member gets hurt.', 'Y', 'N', 9.2),
	('House MD', 'Chase', 8, 12, 'Yes', 'Yes', 'No', 13, 2, 2012, 'Chase\'s religious faith bubbles to the surface when he treats a young nun. In addition, he and House reach a fundamental disagreement about the patient that may finally end Chase\'s reputation as House\'s \'yes man\' but also bring\'s House\'s methods, reputation and objectivity are given more serious scrutiny. ', 'Y', 'N', 8.9),
	('House MD', 'Man Of The House', 8, 13, 'Yes', 'Yes', 'No', 20, 2, 2012, 'House\'s green-card wife, Dominika, will return in order to prove to the proper authorities that she and House are actually married. This in turn will lead to a crash course in which both will learn a little something about love and marriage.', 'Y', 'N', 8.2),
	('House MD', 'Love Is Blind', 8, 14, 'Yes', 'Yes', 'No', 19, 3, 2012, 'House and the team battle to save a successful, independent blind man who is struck down by a mysterious illness, just prior to him asking for his girlfriend\'s hand in marriage. Meanwhile, House\'s mother unexpectedly arrives at Princeton Plainsboro to inform him of her new beau.', 'Y', 'N', 8.1),
