	('Inu Yasha', 'The Girl Who Overcame Time And The Boy Who Was Just Overcome', 1, 1, 'Yes', 'Yes', 'NA', 31, 8, 2002, 'Kagome Higurashi has been told many stories by her grandfather, such as the one about the Shikon no Tama (The Jewel of Four Souls) and never believed them until her fifteenth birthday, when she is pulled down a dry well at her shrine by a centipede demon. She emerges from the well to discover she\'s not in Tokyo any more, but instead, she\'s in in Feudal Japan.Kagome discovers a weird boy with dog ears pinned to a tree in a forest and is captured by strange villagers. The high priestess of the village, Kaede, realizes that Kagome looks just like her sister who died 50 years ago.', 'Y', 'N', 8.2),
	('Inu Yasha', 'Seekers Of The Sacred Jewel', 1, 2, 'Yes', 'Yes', 'NA', 7, 9, 2002, 'Inuyasha attacks Kagome to get the Shikon no Tama. Kaede puts a rosary on Inuyasha which causes him to drop to the ground that whenever Kagome utters the word \'sit\'. When trying to get the Shikon no Tama back from a demon that steals it, Kagome accidentally shatters it into hundreds of pieces that are scattered all over Japan!', 'Y', 'N', 7.8),
	('Inu Yasha', 'Down The Rabbit Hole And Back Again', 1, 3, 'Yes', 'Yes', 'NA', 14, 9, 2002, 'After Inuyasha angers her, Kagome decides to return home to the present. At the well, she is attacked by Yura, a demon who is after the Shikon no Tama.', 'Y', 'N', 7.5),
