	('Inu Yasha', 'Aristocratic Assassin, Sesshomaru', 1, 5, 'Yes', 'Yes', 'NA', 28, 9, 2002, 'Inuyasha\'s older brother, Sesshomaru, who is a full demon, crosses paths with Inuyasha in his search for the powerful sword that was left behind by their father.', 'Y', 'N', 7.6),
