	('Inu Yasha', 'Showdown! Inuyasha Vs Sesshomaru!', 1, 7, 'Yes', 'Yes', 'NA', 12, 10, 2002, 'Sesshomaru and Inuyasha clash over possession of the Tetsusaiga. Who will be victorious in this epic fight between these two siblings?', 'Y', 'N', 7.9),
	('Inu Yasha', 'The Toad Who Would Be Prince', 1, 8, 'Yes', 'Yes', 'NA', 19, 10, 2002, 'On their search for Shikon jewel shards, Inuyasha and Kagome come across Amari Nobunaga, who is on a search and rescue mission for his beloved Princess Tsuyu.', 'Y', 'N', 6.8),
	('Inu Yasha', 'Enter Shippo Plus, The Amazing Thunder Brothers!', 1, 9, 'Yes', 'Yes', 'NA', 26, 10, 2002, 'Inuyasha and Kagome meet a fox demon named Shippo. The young fox explains that he is looking for jewel shards so he can become strong enough to fight the Thunder Brothers, Hiten and Manten. Inuyasha soon goes to face off against the brothers for the jewel shards that they possess.', 'Y', 'N', 7.6),
	('Inu Yasha', 'Phantom Showdown - The Thunder Brothers Vs Tetsusaiga', 1, 10, 'Yes', 'Yes', 'NA', 2, 11, 2002, 'Inuyasha and Hiten engage in a fierce battle for the jewel shards, while Kagome and Shippo face off against Manten.', 'Y', 'N', 7.6),
	('Inu Yasha', 'Terror Of The Ancient Noh Mask', 1, 11, 'Yes', 'Yes', 'NA', 9, 11, 2002, 'Kagome returns home to study for a test. Meanwhile, inside the storehouse on the Higurashi shrine grounds, an evil Noh mask that was sealed away a long time ago awakens.', 'Y', 'N', 7.2),
	('Inu Yasha', 'The Soul Piper And The Mischievous Little Soul', 1, 12, 'Yes', 'Yes', 'NA', 16, 11, 2002, 'Kagome helps a troubled ghost move on.', 'Y', 'N', 7.4),
	('Inu Yasha', 'The Mystery Of The New Moon And The Black-Haired Inuyasha', 1, 13, 'Yes', 'Yes', 'NA', 23, 11, 2002, 'Inuyasha, Kagome and Shippo are looking for more jewel shards, when they help out a girl running from a demon. Kagome wants to stay the night at the temple she lives in, but Inuyasha wants to keep moving. In the end, they agree to stay. Later that night, demons surround the temple, and Inuyasha prepares to fight them.', 'Y', 'N', 8.5),
	('Inu Yasha', 'Kikyo\'s Stolen Ashes', 1, 14, 'Yes', 'Yes', 'NA', 30, 11, 2002, 'Kikyo\'s ashes are stolen from her grave by the demon Urasue. As Kaede, Inuyasha, Kagome and Shippo go to retrieve them, Kagome realizes that Inuyasha and Kikyo were once in love! Meanwhile, with Kikyo\'s ashes, Urasue manages to resurrect Kikyo. However, she finds that Kikyo cannot move without her soul: the very soul that is inside of Kagome!', 'Y', 'N', 8.3),
	('Inu Yasha', 'Return Of The Tragic Priestess, Kikyo', 1, 15, 'Yes', 'Yes', 'NA', 7, 12, 2002, 'Now that Urasue has kidnapped Kagome, she prepares for the soul transfer, which Inuyasha unknowingly activates. Once the soul is transferred, Kikyo attacks Inuyasha. Inuyasha learns of his supposed betrayal of Kikyo, 50 years ago. Kagome soon reclaims her soul and Kikyo runs off to retain at least part of it Inuyasha chases after and thinks back to when Kikyo convinced him to use the Shikon no Tama, to become Human!', 'Y', 'N', 8.4),
	('Inu Yasha', 'Mystical Hand Of The Amorous Monk, Miroku', 1, 16, 'Yes', 'Yes', 'NA', 7, 12, 2002, 'Inuyasha, Kagome and Shippo cross paths with Miroku, a lecherous monk with a \'black hole\' in his right hand. Miroku explains that his black hole (Wind Tunnel) came from the evil Naraku, an extremely evil shapeshifter who cursed his grandfather and his descendents with the Wind Tunnel. Inuyasha also learns something new about what happened to him and Kikyo, long ago.', 'Y', 'N', 7.9),
	('Inu Yasha', 'Cursed Ink Of The Hell-Painter', 1, 17, 'Yes', 'Yes', 'NA', 14, 12, 2002, 'Inuyasha and the others become entangled with an odd painter who has been corrupted by the power of a Shikon shard.', 'Y', 'N', 7.2),
	('Inu Yasha', 'Naraku And Sesshomaru Join Forces', 1, 18, 'Yes', 'Yes', 'NA', 14, 12, 2002, 'The one-armed Sesshomaru receives a Shikon-enhanced arm with which to wield Tetsusaiga from a mysterious man, wearing a baboon cloak, named Naraku. This leads Sesshomaru to go after Inuyasha, once more.', 'Y', 'N', 7.6),
	('Inu Yasha', 'Go Home To Your Own Time, Kagome!', 1, 19, 'Yes', 'Yes', 'NA', 21, 12, 2002, 'After a badly beaten Inuyasha gets ahold of Tetsusaiga once more, Sesshomaru backs off. Convinced that Kagome doesn\'t belong in the past, Inuyasha takes her to the well, hugs her close, takes her shards, and pushes her back through, to the present time.', 'Y', 'N', 7.6),
	('Inu Yasha', 'Despicable Villain! The Mystery Of Onigumo!', 1, 20, 'Yes', 'Yes', 'NA', 21, 12, 2002, 'Kaede informs the group of Onigumo, a paralyzed bandit who had an unhealthy obsession with Kikyo, and tells them of his sudden disappearance. The group then has to deal with an attack by the Shikon-induced Royakan!', 'Y', 'N', 7.2),
	('Inu Yasha', 'Naraku\'s True Identity Unveiled', 1, 21, 'Yes', 'Yes', 'NA', 28, 12, 2002, 'As Kagome goes on a date with Hojo, all hell breaks loose in the past as Inuyasha battles with Royakan. When Naraku reveals himself to the group his true identity is soon discovered!', 'Y', 'N', 7.4),
	('Inu Yasha', 'A Wicked Smile, Kikyo\'s Wandering Soul', 1, 22, 'Yes', 'Yes', 'NA', 28, 12, 2002, 'Since Kagome reclaimed most of her soul, Kikyo now walks the land and steals the souls from young girls. This act inadvertently leads Kagome and Inuyasha right to her!', 'Y', 'N', 7.3),
	('Inu Yasha', 'Kagome\'s Voice And Kikyo\'s Kiss', 1, 23, 'Yes', 'Yes', 'NA', 14, 1, 2003, 'Inuyasha goes to meet with Kikyo. Kagome, Miroku and Shippo are waiting for him to return, when they see some soul collectors. They decide to chase after them', 'Y', 'N', 7.2),
	('Inu Yasha', 'Enter Sango, The Demon Slayer', 1, 24, 'Yes', 'Yes', 'NA', 15, 1, 2003, 'After her family is murdered in front of her eyes, the demon slayer Sango learns from Naraku that her village was destroyed by Inuyasha.', 'Y', 'N', 7.4),
	('Inu Yasha', 'Naraku\'s Insidious Plot', 1, 25, 'Yes', 'Yes', 'NA', 16, 1, 2003, 'Believing that Inuyasha destroyed her village, Sango goes after Inuyasha.', 'Y', 'N', 7.6),
	('Inu Yasha', 'Secret Of The Jewel Of Four Souls Revealed', 1, 26, 'Yes', 'Yes', 'NA', 17, 1, 2003, 'Sango shows the group where the Shikon no Tama was created, thus revealing the story of its origin.', 'Y', 'N', 7.3),
	('Inu Yasha', 'The Lake Of The Evil Water God', 1, 27, 'Yes', 'Yes', 'NA', 21, 1, 2003, 'When a water god starts demanding child sacrifices, it\'s up to Inuyasha and the others to stop him.', 'Y', 'N', 7.8),
	('Inu Yasha', 'Miroku Falls Into A Dangerous Trap', 2, 1, 'Yes', 'Yes', 'NA', 22, 1, 2003, 'After Miroku sucks a mantis demon into his Wind Tunnel, the demon manages to rip the tunnel. Panicked, Miroku returns to the home of his mentor, Mushin, to repair it. Haunted with memories of his father\'s death, Miroku must come to terms with his Wind Tunnel as demons attack Mushin\'s temple.', 'Y', 'N', 6.8),
	('Inu Yasha', 'Sango\'s Suffering And Kohaku\'s Life', 2, 2, 'Yes', 'Yes', 'NA', 23, 1, 2003, 'Naraku uses one of Sango\'s fellow demon slayers as a bargaining chip to try to persuade Sango into giving him Inuyasha\'s sword, Tetsusaiga.', 'Y', 'N', 7),
	('Inu Yasha', 'Tetsusaiga Is Stolen! Showdown At Naraku\'s Castle!', 2, 3, 'Yes', 'Yes', 'NA', 24, 1, 2003, 'In the hopes of saving Kohaku, Sango steals Inuyasha\'s Tetsusaiga and hands it over to Naraku. However, a battle against Naraku soon ensues.', 'Y', 'N', 7),
	('Inu Yasha', 'Jinenji, Kind Yet Sad', 2, 4, 'Yes', 'Yes', 'NA', 28, 1, 2003, 'While looking for an antidote to cure the ailing Kilala, Inuyasha and Kagome come across the herb garden of the half-demon, Jinenji, who is constantly bullied by the prejudiced locals.', 'Y', 'N', 6.9),
	('Inu Yasha', 'Kikyo And Inuyasha, Into The Miasma', 2, 5, 'Yes', 'Yes', 'NA', 29, 1, 2003, 'Inuyasha and the others stumble across a cave full of demons fighting to the death. They soon discover that Naraku is using to find a new demon to integrate into his being. However, the large demonic aura brings Kikyo into the mess.', 'Y', 'N', 7),
	('Inu Yasha', 'Kikyo, Captured By Naraku', 2, 6, 'Yes', 'Yes', 'NA', 30, 1, 2003, 'Acting under Naraku\'s request, Kikyo traps the Inuyasha gang with an illusory mist, causing them to have nightmarish visions.', 'Y', 'N', 7.6),
	('Inu Yasha', 'Tetsusaiga And Tenseiga', 2, 7, 'Yes', 'Yes', 'NA', 31, 1, 2003, 'Inuyasha and the others are introduced to Totosai, the swordsmith who forged Inuyasha\'s Tetsusaiga and Sesshomaru\'s healing sword, Tenseiga.', 'Y', 'N', 7),
	('Inu Yasha', 'The True Owner Of The Great Sword!', 2, 8, 'Yes', 'Yes', 'NA', 3, 2, 2003, 'Inuyasha and Sesshomaru continue fighting for the Tetsusaiga. After the fight, while Sesshomaru is recovering, a little orphan girl, Rin, tries to bring him food. When her village is attacked by wolf demons, Sesshomaru returns the favor and helps Rin. Meanwhile, Kagome senses a jewel shard. Inuyasha and gang follow her lead to the massacred village, where they are quickly surrounded by wolves and Koga.', 'Y', 'N', 7.2),
	('Inu Yasha', 'Kagome Kidnapped By Koga, The Wolf Demon!', 2, 9, 'Yes', 'Yes', 'NA', 5, 2, 2003, 'When Koga, a wolf demon, kidnaps Kagome and Shippo, Inuyasha, Miroku and Sango go on a rescue mission. But there\'s another foe they must defeat first, before they can reach their kidnapped companions.', 'Y', 'N', 6.6),
	('Inu Yasha', 'The Man Who Fell In Love With Kagome!', 2, 10, 'Yes', 'Yes', 'NA', 25, 8, 2003, 'Inuyasha and the group must battle the Birds of Paradise, before they can reach the wolf den. Meanwhile, back at the den, Koga expresses his true feelings for Kagome. When the final battle with the Birds ensues, will Inuyasha\'s jealousy cost Koga his life?', 'Y', 'N', 6.8),
	('Inu Yasha', 'Two Hearts, One Mind', 2, 11, 'Yes', 'Yes', 'NA', 26, 8, 2003, 'Kagome has returned home from the Feudal Era after an argument with Inuyasha. While waiting for Inuyasha to apologize, she spends time with her friends and Hojo approaches her, once again. Meanwhile, Inuyasha gets some advice from Kaede on the situation.', 'Y', 'N', 6.5),
	('Inu Yasha', 'Trapped In A Duel To The Death!', 2, 12, 'Yes', 'Yes', 'NA', 27, 8, 2003, 'While Inuyasha\'s gang follows a demon bear with a jewel shard, Koga meets with some demons from the northern pack who tell him about their plan to storm a castle where a man has many jewel shards. When the chase leads Inuyasha and his comrades to the castle, they meet up with Koga, who is furious at the slaughter of the wolf demons.', 'Y', 'N', 6.5),
	('Inu Yasha', 'The Deadly Trap Of Kagura, The Wind Sorceress!', 2, 13, 'Yes', 'Yes', 'NA', 28, 8, 2003, 'While Miroku and Sango fight Naraku\'s demon puppet, Inuyasha and Koga continue their deadly battle, with Kagura planning to kill the winner.', 'Y', 'N', 6.6),
	('Inu Yasha', 'Kagura\'s Dance And Kanna\'s Mirror', 2, 14, 'Yes', 'Yes', 'NA', 1, 9, 2003, 'Inuyasha and his companions come upon an orphan named Koharu, a young woman who believes she is in love with Miroku, after he helped her three years ago. When Koharu needs help again, they assist her and find her a home in a new village. When Naraku sends Kagura and Kanna to destroy Inuyasha and his companions, Koharu and the villagers become the new pawns in Naraku\'s devious plan.', 'Y', 'N', 6.5),
	('Inu Yasha', 'The Wind Scar Fails', 2, 15, 'Yes', 'Yes', 'NA', 2, 9, 2003, 'Inuyasha and his group must defend themselves against an attack on multiple fronts. Kanna attacks Kagome, attempting to suck her soul into her mirror while Sango remains unconscious in the same room. Koharu tries to stab Miroku, while Inuyasha battles Kagura. Can Inuyasha use his Wind Scar to defeat her?', 'Y', 'N', 7.5),
	('Inu Yasha', 'Tetsusaiga Breaks', 2, 16, 'Yes', 'Yes', 'NA', 3, 9, 2003, 'Inuyasha, though still recovering from his serious wounds, fights Goshinki, a demon who is eating an entire village.', 'Y', 'N', 8.2),
	('Inu Yasha', 'Kaijinbo\'s Evil Sword', 2, 17, 'Yes', 'Yes', 'NA', 4, 9, 2003, 'Sesshomaru goes to a swordsmith, Kaijinbo, to get a new sword made from the fangs of the demon that broke Tetsusaiga, Goshinki. But something unexpected happens, and Kaijinbo attacks Inuyasha on the night of the new moon, when Inuyasha reverts to his human form.', 'Y', 'N', 7.1),
	('Inu Yasha', 'Sesshomaru Wields Tokijin', 2, 18, 'Yes', 'Yes', 'NA', 8, 9, 2003, 'Inuyasha, wielding a too heavy Tetsusaiga, tries to defend himself against Kaijinbo who has been possessed by Tokijin. Unbeknownst to Inuyasha, Sesshomaru is looking for Kaijinbo and the sword he had commissioned. Will Inuyasha be able to withstand his brother, when Sesshomaru reclaims Tokijin?', 'Y', 'N', 7.3),
	('Inu Yasha', 'Juromaru And Kageromaru', 2, 19, 'Yes', 'Yes', 'NA', 9, 9, 2003, 'Naraku sends his two new incarnations, Juromaru & Kageromaru, to attack Koga, and also, Inuyasha and his companions. Can Inuyasha and Koga work together as a team to defeat these new foes?', 'Y', 'N', 7.5),
	('Inu Yasha', 'Onigumo\'s Heart Still Beats Within Naraku', 2, 20, 'Yes', 'Yes', 'NA', 10, 9, 2003, 'As Inuyasha and the others recover from their battle with Juromaru and Kageromaru, Kagome goes home. Meanwhile, Naraku comes after Kikyo, and she must flee for her life.', 'Y', 'N', 7.4),
	('Inu Yasha', 'Return To The Place Where We First Met', 2, 21, 'Yes', 'Yes', 'NA', 11, 9, 2003, 'Inuyasha and Kagome must sort out their feeings for each other, after Kagome has spied him with Kikyou, again. Who will Inuyasha choose?', 'Y', 'N', 7.4),
	('Inu Yasha', 'Kohaku\'s Lost Memory', 2, 22, 'Yes', 'Yes', 'NA', 15, 9, 2003, 'While searching for Naraku\'s castle, Inuyasha and his group find Kohaku, who has lost his memory.', 'Y', 'N', 6.8),
	('Inu Yasha', 'That Unforgettable Face!', 2, 23, 'Yes', 'Yes', 'NA', 16, 9, 2003, 'Sango and Kilala fight off demons in the woods, while Inuyasha and Miroku face off against Kagura, a horde of demons and Naraku\'s wasps. Meanwhile, Kagome faces Kohaku, who is being ordered to kill her by Naraku.', 'Y', 'N', 6.6),
	('Inu Yasha', 'Inuyasha\'s Soul, Devoured', 2, 24, 'Yes', 'Yes', 'NA', 17, 9, 2003, 'Sesshomaru learns from the wise tree-demon, Boku\'seno that when Inuyasha transforms into a demon, his demon blood takes full control turning him into a mindless killing machine. Elsewhere, Inuyasha and the others arrive at a village that is ruthlessly being held under the control of the Moth Demon, Gatenmaru and his band of thieves.', 'Y', 'N', 8.6),
	('Inu Yasha', 'The Demon\'s True Nature', 2, 25, 'Yes', 'Yes', 'NA', 18, 9, 2003, 'Inuyasha, once again, transforms into a demon when faced with Gatenmaru\'s murderous attack against himself, Miroku, and the helpless women of a village. Sesshomaru then appears to see if what Boku\'seno told him about demon Inuyasha was true.', 'Y', 'N', 7.6),
	('Inu Yasha', 'Father\'s Old Enemy - Ryukotsusei', 2, 26, 'Yes', 'Yes', 'NA', 24, 4, 2004, 'Totosai tells Inuyasha that piercing the heart of Ryukotsusei, the demon that gave his father his mortal wound, will make his Tetsusaiga lighter. Inuyasha then decides to kill Ryukotsusei.', 'Y', 'N', 7),
	('Inu Yasha', 'The Backlash Wave - Tetsusaiga\'s Ultimate Technique', 2, 27, 'Yes', 'Yes', 'NA', 1, 5, 2004, 'Inuyasha fights Ryukotsusei with Tetsusaiga\'s ultimate attack: The Backlash Wave!', 'Y', 'N', 6.1),
	('Inu Yasha', 'The Stone Flower And Shippo\'s First Love', 3, 1, 'Yes', 'Yes', 'NA', 8, 5, 2004, 'Shippo develops a crush on Satsuki, a girl who hopes to wish her dead brother back to life with a fake Shikon shard.', 'Y', 'N', 6.9),
	('Inu Yasha', 'Temptress In The Mist', 3, 2, 'Yes', 'Yes', 'NA', 15, 5, 2004, 'Sango and Miroku investigate a demon princess who is stealing the men from a village.', 'Y', 'N', 6.9),
	('Inu Yasha', 'Fateful Night In Togenkyo - 1', 3, 3, 'Yes', 'Yes', 'NA', 22, 5, 2004, 'After Sango leaves to repair her damaged Hiraikotsu, Inuyasha and the others come across a demon tree and a sage known as Tokajin, who uses humans to feed the tree so it can grow a fruit of immortality. Not only do the four manage to be caught by Tokajin in some way, but it\'s also the night of the new moon, when Inuyasha becomes human.', 'Y', 'N', 7.6),
	('Inu Yasha', 'Fateful Night In Togenkyo - 2', 3, 4, 'Yes', 'Yes', 'NA', 29, 5, 2004, 'After Sango leaves to repair her damaged Hiraikotsu, Inuyasha and the others come across a Demon tree and the Peach Man who uses humans to feed it so it can grow a fruit of immortality. Not only do the four manage to caught by the Peach Man in some way, but it\'s also the night of the New Moon when Inuyasha becomes human!', 'Y', 'N', 8.1),
	('Inu Yasha', 'The Beautiful Sister Apprentices', 3, 5, 'Yes', 'Yes', 'NA', 5, 6, 2004, 'As Sango is repairing her damaged Hiraikotsu at her home village, she encounters two sisters who ask her to teach all she knows about demon slaying.', 'Y', 'N', 6),
	('Inu Yasha', 'The 50 Year-Old Curse Of The Dark Priestess', 3, 6, 'Yes', 'Yes', 'NA', 12, 6, 2004, 'Naraku enlists the help of Tsubaki, a dark priestess with a fifty year grudge against Kikyo, to possess Kagome and use her to kill Inuyasha!', 'Y', 'N', 7.5),
	('Inu Yasha', 'Kikyo And The Dark Priestess', 3, 7, 'Yes', 'Yes', 'NA', 19, 6, 2004, 'After a confrontation with Kikyo, Tsubaki goes off to face Inuyasha and the others.', 'Y', 'N', 6.4),
	('Inu Yasha', 'Tsubaki\'s Unrelenting Evil Spell', 3, 8, 'Yes', 'Yes', 'NA', 26, 6, 2004, 'Kagome fights Tsubaki\'s curse from within herself as Inuyasha and the others continue to struggle against Tsubaki and her gaggle of demons.', 'Y', 'N', 7.9),
	('Inu Yasha', 'The Red And White Priestesses', 3, 9, 'Yes', 'Yes', 'NA', 3, 7, 2004, 'In order to keep Inuyasha and the others at bay while she invokes the power of a sealed-up ogre, Tsubaki enlists the help of two rookie priestesses.', 'Y', 'N', 6.1),
	('Inu Yasha', 'Giant Ogre Of The Forbidden Tower', 3, 10, 'Yes', 'Yes', 'NA', 10, 7, 2004, 'Tsubaki uses the once sealed ogre in a final attempt to kill off Inuyasha once and for all...', 'Y', 'N', 6.5),
	('Inu Yasha', 'Farewell Days Of My Youth', 3, 11, 'Yes', 'Yes', 'NA', 17, 7, 2004, 'Inuyasha and the gang enjoy the hospitality of a village they saved from a centipede demon. However, their stay is interrupted by a string of strange possessions taking hold of the group.', 'Y', 'N', 6.7),
	('Inu Yasha', 'Naraku\'s Barrier - Kagura\'s Decision', 3, 12, 'Yes', 'Yes', 'NA', 24, 7, 2004, 'As Naraku\'s protective barrier around his castle inexplicably weakens, Kagura comtemplates making her move for freedom.', 'Y', 'N', 6.7),
	('Inu Yasha', 'The Howling Wind Of Betrayal', 3, 13, 'Yes', 'Yes', 'NA', 31, 7, 2004, 'Koga furiously attacks Kagura in hopes of retrieving his stolen Shikon shards.', 'Y', 'N', 6.5),
	('Inu Yasha', 'Shippo Gets An Angry Challenge', 3, 14, 'Yes', 'Yes', 'NA', 7, 8, 2004, 'Shippo receives a duel invitation from the last remaining Thunder Brother, Souten.', 'Y', 'N', 7.1),
	('Inu Yasha', 'Terror Of The Faceless Man', 3, 15, 'Yes', 'Yes', 'NA', 14, 8, 2004, 'A chunk of flesh rejected by Naraku, takes form and terrorizes the countryside.', 'Y', 'N', 8),
	('Inu Yasha', 'Onigumo\'s Memory Restored', 3, 16, 'Yes', 'Yes', 'NA', 21, 8, 2004, 'Muso tries to capture Kagome and Inuyasha must protect her. But there is a new snag when Muso regains Onigumo\'s memories.', 'Y', 'N', 7.6),
	('Inu Yasha', 'Three-Sided Battle To The Death', 3, 17, 'Yes', 'Yes', 'NA', 28, 8, 2004, 'Naraku tries to absorb Muso back into his body.', 'Y', 'N', 7.9),
	('Inu Yasha', 'Totosai\'s Rigid Training', 3, 18, 'Yes', 'Yes', 'NA', 4, 9, 2004, 'Inuyasha visits Totosai for some help on making Tesusaiga strong enough to destroy Naraku\'s barrier.', 'Y', 'N', 5.9),
	('Inu Yasha', 'Shiori\'s Family And Inuyasha\'s Feelings', 3, 19, 'Yes', 'Yes', 'NA', 11, 9, 2004, 'To break Naraku\'s barrier, Inuyasha must strengthen the Tetsusaiga by making it absorb the blood of a bat-demon protecting its nest with a strong barrier.', 'Y', 'N', 7),
	('Inu Yasha', 'The Red Tetsusaiga Breaks The Barrier!', 3, 20, 'Yes', 'Yes', 'NA', 18, 9, 2004, 'Inuyasha must decide between making Tetsusaiga stronger and keeping Shiori alive.', 'Y', 'N', 6.6),
	('Inu Yasha', 'The Plot Of The Panther Devas', 3, 21, 'Yes', 'Yes', 'NA', 25, 9, 2004, 'Inuyasha and Company are targeted by a group of cat demons who are after the Shikon shards...', 'Y', 'N', 6.5),
	('Inu Yasha', 'Target - Sesshomaru And Inuyasha', 3, 22, 'Yes', 'Yes', 'NA', 2, 10, 2004, 'Inuyasha and Koga fight the panther demons and Sesshomaru joins in the fight.', 'Y', 'N', 7.6),
	('Inu Yasha', 'The Panther Tribe And The Two Swords Of The Fang', 3, 23, 'Yes', 'Yes', 'NA', 9, 10, 2004, 'Inuyasha and Koga separately try to rescue Kagome. Meanwhile, Sesshomaru continues his battle against the panther demons.', 'Y', 'N', 6.2),
	('Inu Yasha', 'Only You, Sango', 3, 24, 'Yes', 'Yes', 'NA', 16, 10, 2004, 'When Inuyasha and his group are approached by a man, it turns out that the stranger has been searching for Sango, to ask her to slay a demon that is plaguing his village. When the group arrives in the village, Sango is surprised to meet an old acquaintance.', 'Y', 'N', 6.8),
	('Inu Yasha', 'Jaken\'s Plan To Steal The Tetsusaiga', 3, 25, 'Yes', 'Yes', 'NA', 10, 1, 2005, 'A question from Rin prompts Jaken to question his worth to Sesshomaru. He decides to prove himself by stealing Tetsusaiga from Inuyasha.', 'Y', 'N', 7.5),
	('Inu Yasha', 'Sesshomaru And The Abducted Rin', 3, 26, 'Yes', 'Yes', 'NA', 11, 1, 2005, 'Sesshomaru confronts Naraku after he has ordered Kagura to kidnap Rin.', 'Y', 'N', 7.2),
	('Inu Yasha', 'Vanishing Point, Naraku Disappears', 3, 27, 'Yes', 'Yes', 'NA', 12, 1, 2005, 'Sesshomaru and Inuyasha double-team Naraku as he tries to absorb them to become stronger.', 'Y', 'N', 6.9),
	('Inu Yasha', 'Gap Between The Ages', 3, 28, 'Yes', 'Yes', 'NA', 17, 1, 2005, 'The group returns to Kaede\'s village, at which point Kagome returns to modern-day Tokyo.', 'Y', 'N', 7),
	('Inu Yasha', 'The Female Wolf-Demon And The Lunar Rainbow Promise', 4, 1, 'Yes', 'Yes', 'NA', 18, 1, 2005, 'A female wolf demon asks Koga to keep the promise he made to her, when she was a child.', 'Y', 'N', 6.5),
	('Inu Yasha', 'Koga\'s Bride-To-Be', 4, 2, 'Yes', 'Yes', 'NA', 19, 1, 2005, 'Koga must resolve his issues with Ayame, while fighting off the hair demon that is after the jewel shards in his legs.', 'Y', 'N', 6.5),
	('Inu Yasha', 'The Evil Within Demon\'s Head Castle', 4, 3, 'Yes', 'Yes', 'NA', 24, 1, 2005, 'Inuyasha and company, including a old demon exorcist, travel to Demon\'s Head Castle, in search of a powerful demon plaguing the people.', 'Y', 'N', 6.6),
	('Inu Yasha', 'Secret Of The Possessed Princess', 4, 4, 'Yes', 'Yes', 'NA', 25, 1, 2005, 'Inuyasha battles a demon that has appeared in the castle. Shortly after they take their battle outside, Sango and the old exorcist decide to go find Miroku. Meanwhile Kagome and Shippo discover a secret about the princess in the lord\'s chamber of the castle.', 'Y', 'N', 6.3),
	('Inu Yasha', 'Kikyo\'s Lonely Journey', 4, 5, 'Yes', 'Yes', 'NA', 26, 1, 2005, 'Kikyo comes across an old man, who turns out to have a past connection with Onigumo when he was young.', 'Y', 'N', 8),
	('Inu Yasha', 'The Three Sprites Of The Monkey God', 4, 6, 'Yes', 'Yes', 'NA', 31, 1, 2005, 'Inuyasha and the rest of the group are passing by a village, and soon learn of three monkeys that are searching for their master.', 'Y', 'N', 5.7),
	('Inu Yasha', 'Nursing Battle Of The Rival Lovers', 4, 7, 'Yes', 'Yes', 'NA', 1, 2, 2005, 'Kagome is forced to return home when her cold worsens. While there, she is visited by her school friends, and Inuyasha winds up competing with Hojo to determine who cares more for Kagome\'s health.', 'Y', 'N', 7),
	('Inu Yasha', 'Sota\'s Brave Confession Of Love', 4, 8, 'Yes', 'Yes', 'NA', 2, 2, 2005, 'As Inuyasha\'s stay with Kagome in the Modern era continues, Inuyasha takes his first trip with Kagome to a grocery store. Along the way back, they spot Sota and discover he has his first crush on a girl in his class.', 'Y', 'N', 7),
	('Inu Yasha', 'The Suspicious Faith Healer And The Black Kirara', 4, 9, 'Yes', 'Yes', 'NA', 7, 2, 2005, 'Kuroro, who is part of Kirara\'s species except with more black markings, once belonged to a village. She is considered a highly intelligent youkai who helps the village by exterminating all the rats and mice there. She was chased out, though, when a spiritualist person came and said that two-tailed cats were bad fortune.', 'Y', 'N', 5.8),
	('Inu Yasha', 'Plot Of The Walking Dead', 4, 10, 'Yes', 'Yes', 'NA', 8, 2, 2005, 'Kikyo encounters a girl who\'s also a walking dead. The Inuyasha gang finds out, through the girl, about another walking dead\'s plan to conquer the land.', 'Y', 'N', 6.4),
	('Inu Yasha', 'The Mysterious, Lecherous Monk', 4, 11, 'Yes', 'Yes', 'NA', 9, 2, 2005, 'The Inuyasha group tracks down someone who\'s been using Miroku\'s identity.', 'Y', 'N', 7.1),
	('Inu Yasha', 'The Sacred Jewel Maker - 1', 4, 12, 'Yes', 'Yes', 'NA', 14, 2, 2005, 'Inuaysha and the others find a demon using a fake Sacred Jewel and, with the help of a scholar, search to find out how, and why.', 'Y', 'N', 7.2),
	('Inu Yasha', 'The Sacred Jewel Maker - 2', 4, 13, 'Yes', 'Yes', 'NA', 15, 2, 2005, 'With his friends imprisoned, body and soul, inside the toad demon\'s slime to be sacrificed for the making of a second Sacred Jewel, Inuyasha must face off against a half-demon powered up by a dozen fake jewels alone', 'Y', 'N', 7.6),
	('Inu Yasha', 'Jaken Falls Ill', 4, 14, 'Yes', 'Yes', 'NA', 16, 2, 2005, 'Jaken is poisoned and it\'s up to Rin to find a cure for him before it\'s too late.', 'Y', 'N', 7.1),
	('Inu Yasha', 'Kirara Come Home!', 4, 15, 'Yes', 'Yes', 'NA', 21, 2, 2005, 'When Sango notices that Kilala seems to have disappeared, she starts to worry, and soon everyone starts looking for her.', 'Y', 'N', 6.4),
	('Inu Yasha', 'Kikyo And Kagome - Alone In The Cave', 4, 16, 'Yes', 'Yes', 'NA', 22, 2, 2005, 'Kagome and Inuyasha are fighting again and Kagome becomes so enraged she storms off. When she investigates a noise coming from a cave, she becomes trapped together with Kikyo.', 'Y', 'N', 7.8),
	('Inu Yasha', 'Koga And Sesshomaru - A Dangerous Encounter', 4, 17, 'Yes', 'Yes', 'NA', 23, 2, 2005, 'Ginta and Hakkaku come across Jaken and Rin at a river, meanwhile Koga is elsewhere flirting with Kagome and fighting with Inuyasha. Soon Koga meets up with Ginta and Hakkaku. Koga wants to go to the river, but his two friends want to keep him safely away...', 'Y', 'N', 6.2),
	('Inu Yasha', 'The Truth Behind The Nightmare - Battle In The Forest Of Sorrow', 4, 18, 'Yes', 'Yes', 'NA', 28, 2, 2005, 'While travelling, Inuyasha smells a familiar scent; it\'s the moth demon leader. As they battle the leader, everyone except Inuyasha gets trapped in a cocoon, where they have nightmares about their worst fears.', 'Y', 'N', 7.8),
	('Inu Yasha', 'The Snow From Seven Years Past', 4, 19, 'Yes', 'Yes', 'NA', 1, 3, 2005, 'Miroku hears that a snow maiden possessing the form of a woman from his youth is terrorizing the village men and goes out alone to investigate', 'Y', 'N', 7.1),
	('Inu Yasha', 'Assault On The Wolf-Demon Tribe!', 4, 20, 'Yes', 'Yes', 'NA', 28, 5, 2005, 'A deadly spectre arises in the northeast, driving Ayame and her wolf-youkai tribe from their territories, Koga must step in to avenge his fallen brethren.', 'Y', 'N', 7.8),
	('Inu Yasha', 'The Band Of Seven, Resurrected!', 4, 21, 'Yes', 'Yes', 'NA', 4, 6, 2005, 'Inuyasha and the group learn about the deadly Band of Seven. This group was constructed of seven mercenaries who were executed for their inhumane acts. When Kagome senses a sacred jewel shard, Sango goes off on her own and finds her lost brother Kohaku. Meanwhile, Inuyasha encounters one of the Band of Seven, Jakotsu. Jakotsu has strange behavior and wields a strange sword that bends, posing a dangerous problem for Inuyasha.', 'Y', 'N', 8.5),
	('Inu Yasha', 'The Stealthy Poison Master, Mukotsu', 4, 22, 'Yes', 'Yes', 'NA', 11, 6, 2005, 'Inuyasha goes after Jakotsu, and the others are attacked by another member of the Band of Seven; Mukotsu.', 'Y', 'N', 8.2),
	('Inu Yasha', 'The Ghastly Steel Machine', 4, 23, 'Yes', 'Yes', 'NA', 18, 6, 2005, 'Inuyasha is forced to clash with Ginkotsu as he orders Kilala and Shippo to get the poisoned Miroku, Kagome, and Sango to safety. They make it to a monk\'s temple, unaware that Renkotsu has taken over the place.', 'Y', 'N', 8.4),
	('Inu Yasha', 'Kagome, Miroku, And Sango - Desperate Situation', 4, 24, 'Yes', 'Yes', 'NA', 25, 6, 2005, 'Shippo tries to save Kagome, Miroku and Sango from a burning temple.', 'Y', 'N', 8.1),
	('Inu Yasha', 'Inuyasha Shows His Tears For The First Time', 4, 25, 'Yes', 'Yes', 'NA', 2, 7, 2005, 'Inuyasha discovers that Miroku, Sango and Kagome have been poisoned.', 'Y', 'N', 8.3),
	('Inu Yasha', 'The Secret Of The Pure Light', 4, 26, 'Yes', 'Yes', 'NA', 9, 7, 2005, 'Inuyasha and crew enter a village where a man named Suikotsu, the name of one member of the Band of Seven, is living. They discover that he appears to be a good person. Could he truly belong to the Band of Seven?', 'Y', 'N', 7.6),
	('Inu Yasha', 'Hidden In The Mist - Onward To Mt. Hakurei', 4, 27, 'Yes', 'Yes', 'NA', 16, 7, 2005, 'Dr. Suikotsu continues to fight Inuyasha.', 'Y', 'N', 7.9),
	('Inu Yasha', 'Enter Bankotsu, The Leader Of The Band Of Seven', 4, 28, 'Yes', 'Yes', 'NA', 23, 7, 2005, 'Long ago the Lord of a nearby castle was responsible for executing the Band of Seven and now they seek their revenge by attacking the castle. Despite warnings, Inuyasha and his friends approach the castle.', 'Y', 'N', 7.9),
	('Inu Yasha', 'The Big Clash - Banryu Versus The Wind Scar', 5, 1, 'Yes', 'Yes', 'NA', 30, 7, 2005, 'Inuyasha has finally met Bankotsu, the Leader of the Band of Seven, and is determined to use the Tetsuiga to bring him down. But Bankotsu is confident that his Banryu will win without fail. And now, Renkotsu has discovered Kagome\'s ability to see Shikon Jewel shards. Can the Wind Scar defeat Bankotsu and his Banryu?', 'Y', 'N', 7.9),
	('Inu Yasha', 'Afloat On The Lake Surface - The Barrier Of Hijiri Island', 5, 2, 'Yes', 'Yes', 'NA', 7, 8, 2005, 'Inuyasha battles with Bankotsu on the island of Hijiri without being able to use the Wind Scar. Miroku learns that Naraku is using the great priest\'s power to create a barrier around the island of Hijiri weakening Kirara and Shippo, and making Inuyasha unable to use the Wind Scar. Miroku manages to destroy the barrier to allow Inuyasha to regain the power to use the Wind Scar. However, Bankotsu is still confident in defeating Inuyasha.', 'Y', 'N', 7.5),
	('Inu Yasha', 'The Sacred Vajra And The Mystery Of The Living Buddha', 5, 3, 'Yes', 'Yes', 'NA', 14, 8, 2005, 'Koga, Ginta and Hakkaku go to Mt. Hakurei and meet up with some of the seven warriors. Koga fights in a rough battle with them and gets injured. Meanwhile, Jakotsu meets up with Sesshomaru and they fight. Inuyasha, Kagome, Shippo and Kirara are near Mt. Hakurei also, but then, Inuyasha suddenly smells the blood and scent of the wolves and rushes over.', 'Y', 'N', 8.2),
	('Inu Yasha', 'Koga\'s Solitary Battle', 5, 4, 'Yes', 'Yes', 'NA', 21, 8, 2005, 'Renkotsu traps Kagome, Kouga, Shippo, Kirara, Hakkaku and Ginta in a cave that is surrounded by a river of fire. Inuyasha must fight Renkotsu to protect his friends.', 'Y', 'N', 8.2),
	('Inu Yasha', 'Lured By The Black Light', 5, 5, 'Yes', 'Yes', 'NA', 28, 8, 2005, 'Jakotsu attacks Sesshomaru while Suikotsu kidnaps Rin. However, Suikotsu\'s good alter ego takes over temporarily as he takes Rin to the village where he tended to children. When villagers ask for Suikotsu to leave, his evil alter ego takes over and kills one of the villagers. Jakotsu then shows up from hiding.Meanwhile, Kikyo and Sesshomaru head off to go after the three despite the barrier on the town.', 'Y', 'N', 7.8),
	('Inu Yasha', 'The Exposed Face Of Truth', 5, 6, 'Yes', 'Yes', 'NA', 4, 9, 2005, 'Sesshomaru battles with Jakotsu on Mount Hakurei while Suikotsu holds Rin captive. As Suikotsu is about to kill Rin, Kikyo fires an arrow at Suikotsu\'s neck making him change to his good alter ego. The counterpart wishes for Kikyo to remove the Shikon shard from his neck so he won\'t have to suffer the thought of killing anymore because of his evil alter ego. Jakotsu removes the Shikon shard and Suikotsu is reduced to a skeleton.', 'Y', 'N', 7.9),
	('Inu Yasha', 'Vanished In A River Of Flames', 5, 7, 'Yes', 'Yes', 'NA', 11, 9, 2005, 'Renkotsu traps Kagome, Kouga, Shippo, Kirara, Hakkaku and Ginta in a cave that is surrounded by a river of fire. Inuyasha must fight Renkotsu to protect his friends.', 'Y', 'N', 7.9),
	('Inu Yasha', 'Into The Depths Of Mt. Hakurei', 5, 8, 'Yes', 'Yes', 'NA', 17, 9, 2005, 'Sango and Miroku explore a cave in Mt. Hakurei, where they expect to find Naraku, but fall into Kagura\'s trap. Sango\'s weapon is useless against Kagura, the Wind Sorceress. Can Miroku defend them with his Wind Tunnel? Worried that Sango and Miroku have not returned, Inuyasha goes after them, determined to cross the sacred barrier of Mt. Hakurei.', 'Y', 'N', 7.6),
	('Inu Yasha', 'Divine Malice Of The Saint', 5, 9, 'Yes', 'Yes', 'NA', 24, 9, 2005, 'Inuyasha fights for his life against Jakotsu. Kikyo meets Hakushin. What will happen to the sacred barrier after Kikyo intervenes?', 'Y', 'N', 7.6),
	('Inu Yasha', 'Fare Thee Well - Jakotsu\'s Requiem', 5, 10, 'Yes', 'Yes', 'NA', 1, 10, 2005, 'Inuyasha fights for his life against Jakotsu. Kikyo meets Hakushin. What will happen to the sacred barrier after Kikyo intervenes?', 'Y', 'N', 8.3),
	('Inu Yasha', 'Final Battle - The Last And Strongest Of The Band Of Seven', 5, 11, 'Yes', 'Yes', 'NA', 8, 10, 2005, 'Now that the sacred barrier is down, Kagome and the rest of the gang head up Mt. Hakurei. Inuyasha runs into Bankotsu, deep inside the mountain and is forced to fight him. Can Inuyasha win, now that Bankotsu has seven Shikon shards.?', 'Y', 'N', 8.1),
	('Inu Yasha', 'The Power Of Banryu - Duel To The Death On Mt. Hakurei', 5, 12, 'Yes', 'Yes', 'NA', 15, 10, 2005, 'Inuyasha battles with Bankotsu, who is using Banryu, a weapon infused with a demonic aura. Kagome senses that the Shikon shards inside Mt. Hakurei are becoming tainted.', 'Y', 'N', 8.1),
	('Inu Yasha', 'Beyond The Darkness - Naraku Reborn!', 5, 13, 'Yes', 'Yes', 'NA', 22, 10, 2005, 'Inuyasha is lying trapped and unconscious inside Mt. Hakurei, where Naraku\'s new body is being created. Also, trapped inside are Inuyasha\'s companions and Koga. Will Inuyasha awaken, before Naraku tries to destroy him?', 'Y', 'N', 8),
	('Inu Yasha', 'Farewell Kikyo, My Beloved', 5, 14, 'Yes', 'Yes', 'NA', 29, 10, 2005, 'Inuyasha helps Koga to safety and everyone gets out of the mountain safely. Meanwhile, Naraku confronts Kikyo with his new body.', 'Y', 'N', 7.9),
	('Inu Yasha', 'The Darkness In Kagome\'s Heart', 5, 15, 'Yes', 'Yes', 'NA', 5, 11, 2005, 'In the beginning, Inuyasha goes to look for Kikyo. Kagome, Sango, and Miroku get caught by people, and get taken to a village. Kagome gets taken into one of the huts there, leaving Sango and Miroku to fight the people.', 'Y', 'N', 7.7),
	('Inu Yasha', 'Transform Heartache Into Courage!', 5, 16, 'Yes', 'Yes', 'NA', 12, 11, 2005, 'Failing to find Kikyo after sent on a wild goose chase by a priest, Inuyasha is unaware that Kagome and the others are in danger. Miroku and Sango have to defend themselves against murderous guards, while Kagome is in danger from Kagura and a strange baby who is trying to control Kagome\'s heart.', 'Y', 'N', 8.1),
	('Inu Yasha', 'Don\'t Boil It! The Terrifying Dried-Up Demon', 5, 17, 'Yes', 'Yes', 'NA', 4, 1, 2006, 'When Kagome brings back some rare dried food from the feudal era, Inuyasha is forced to travel to modern Japan to protect her, as the food is actually made from dried demons.', 'Y', 'N', 5.9),
	('Inu Yasha', 'Battle Against The Dried-Up Demons At The Cultural Festival', 5, 18, 'Yes', 'Yes', 'NA', 11, 1, 2006, 'While Kagome has her hands full preparing for the Cultural Festival, another dried-food demon appears. After Inuyasha saves the day, Kagome admits that there may be three more demons on the loose. Later, when Inuyasha sees Kagome in a love scene with Hojo in the school play, his temper flares. Will Inuyasha and Hojo be forced to fight over Kagome?', 'Y', 'N', 7.8),
	('Inu Yasha', 'Chokyukai And The Abducted Bride', 5, 19, 'Yes', 'Yes', 'NA', 18, 1, 2006, 'This pig demon called Chokyukai has been wandering around the countryside forcing young women to marry him. But when he puts the magical tiara that makes the women fall in love with him on Kagome, InuYasha is the one who\'s lovestricken!', 'Y', 'N', 5.8),
	('Inu Yasha', 'Shippo\'s New Technique, The Heart Scar', 5, 20, 'Yes', 'Yes', 'NA', 25, 1, 2006, 'Shippo meets a group of fox demons who heard a legend about the mighty and powerful Shippo and they ask him to protect them from a lizard demon. Shippo uses his ultimate attack, the Heart Scar.', 'Y', 'N', 6.3),
	('Inu Yasha', 'Trap Of The Cursed Wall Hanging', 5, 21, 'Yes', 'Yes', 'NA', 1, 2, 2006, 'The Inuyasha gang hears about a village of demon women and they decide to find it.', 'Y', 'N', 6.6),
	('Inu Yasha', 'Miroku\'s Most Dangerous Confession', 5, 22, 'Yes', 'Yes', 'NA', 8, 2, 2006, 'Inuyasha must save Sango and Miroku from the village women and the demon that is controlling them..', 'Y', 'N', 7),
	('Inu Yasha', 'The Woman Who Loved Sesshomaru - 1', 5, 23, 'Yes', 'Yes', 'NA', 15, 2, 2006, 'Inuyasha and his group travel to a coastal town where they meet a beautiful woman, who attempts to steal the Tetsusaiga.', 'Y', 'N', 6.5),
	('Inu Yasha', 'The Woman Who Loved Sesshomaru - 2', 5, 24, 'Yes', 'Yes', 'NA', 22, 3, 2006, 'Inuyasha and Sesshomaru confront Sara, but Sara has a terrible secret.', 'Y', 'N', 6),
	('Inu Yasha', 'The Last Banquet Of Miroku\'s Master', 5, 25, 'Yes', 'Yes', 'NA', 1, 3, 2006, 'Miroku finds out that Mushin, the monk who raised him, is dying, and he goes to see him.', 'Y', 'N', 7.5),
	('Inu Yasha', 'A Strange Invisible Demon Appears!', 5, 26, 'Yes', 'Yes', 'NA', 8, 3, 2006, 'Inuyasha and his group meet someone they know when they travel to a small town and Miroku plans to make use of his exorcist skills to earn some money.', 'Y', 'N', 6.8),
	('Inu Yasha', 'An Ancestor Named Kagome', 5, 27, 'Yes', 'Yes', 'NA', 15, 3, 2006, 'Inuyasha and his gang take on the task of purifying a cursed sword brought to them by Akitoki Hojo, ancestor to the Hojo in Kagome\'s time. Back in present day Japan, Kagome finds out that Hojo has ancestor named Kagome, who married Akitoki! What does this mean for Kagome? Does she stay in the feudal era and marry Akitoki, or is it mere coincidence?', 'Y', 'N', 6.9),
	('Inu Yasha', 'Mountain Of Demons - Survival Of The Duo', 5, 28, 'Yes', 'Yes', 'NA', 22, 3, 2006, 'While on a mission to purify the Ken blade, Kagome and Akitoki become separated from Inuyasha and the others. Then Kagome and Akitoki get attacked by the ninja demons. What will be their fate?', 'Y', 'N', 6.8),
	('Inu Yasha', 'The Great Duel At Shoun Falls', 6, 1, 'Yes', 'Yes', 'NA', 29, 3, 2006, 'Inuyasha and the others go to meet the ninja demon, who has taken Kagome hostage, at Shoun Falls.', 'Y', 'N', 7.4),
	('Inu Yasha', 'Eternal Love, The Naginata Of Kenkon', 6, 2, 'Yes', 'Yes', 'NA', 5, 4, 2006, 'Hoshiyomi plans to destroy humanity using the Naginata of Kenkon.', 'Y', 'N', 7.1),
	('Inu Yasha', 'Entei, The Demon Horse Unleashed!', 6, 3, 'Yes', 'Yes', 'NA', 12, 4, 2006, 'Inuyasha and his group decide to investigate a series of murders which they hear were committed by a woman with a baby.', 'Y', 'N', 6.2),
	('Inu Yasha', 'Untamed Entei And Horrible Hakudoshi', 6, 4, 'Yes', 'Yes', 'NA', 19, 4, 2006, 'Naraku\'s child Hakudoshi kills Rygokoki, takes his weapon and earns the right to ride on the legendry horse demon Entei', 'Y', 'N', 7.2),
	('Inu Yasha', '3,000 Leagues In Search Of Father', 6, 5, 'Yes', 'Yes', 'NA', 26, 4, 2006, 'When Inuyasha and his friends visit a a new town, they find out that a headless demon has been frightening the townspeople.', 'Y', 'N', 7.3),
	('Inu Yasha', 'Hosenki And The Last Shard', 6, 6, 'Yes', 'Yes', 'NA', 3, 5, 2006, 'Inuyasha searches for Myoga to figure out how to get to the border between this world and the next, and his father\'s grave, where the last shard of the sacred jewel may be hidden.', 'Y', 'N', 6.2),
	('Inu Yasha', 'Bizarre Guards At The Border Of The Afterlife', 6, 7, 'Yes', 'Yes', 'NA', 10, 5, 2006, 'Inuyasha and his friends attempt to reach the graveyard located beyond the border of this world.', 'Y', 'N', 7),
	('Inu Yasha', 'The Fiery Bird Master, Princess Abi', 6, 8, 'Yes', 'Yes', 'NA', 17, 5, 2006, 'After Inuyasha and his friends return from the Land of Fire, they come across several villages where everyone has had all their blood sucked out of them.', 'Y', 'N', 7.3),
	('Inu Yasha', 'The Tragic Love Song Of Destiny - 1', 6, 9, 'Yes', 'Yes', 'NA', 24, 5, 2006, 'Kaede narrates a special episode that explains Kikyo\'s life as a priestess (a miko), how she met Inuyasha, how she ended up receiving the Shikon no Tama and more.', 'Y', 'N', 8.5),
	('Inu Yasha', 'The Tragic Love Song Of Destiny - 2', 6, 10, 'Yes', 'Yes', 'NA', 31, 5, 2006, 'Kaede narrates a special episode that explains Kikyo\'s life as a miko, her recieving the Shikon no Tama and Naraku\'s trap for her and Inuyasha.', 'Y', 'N', 7.5),
	('Inu Yasha', 'The Single Arrow Of Chaos', 6, 11, 'Yes', 'Yes', 'NA', 7, 6, 2006, 'Inuyasha and the others are on a mission to find Princess Abi and her nest of birds. However, they must get past Hakudoshi, first.', 'Y', 'N', 6.9),
	('Inu Yasha', 'The Mysterious Light That Guides The Saint', 6, 12, 'Yes', 'Yes', 'NA', 14, 6, 2006, 'Princess Abi goes after a group of villagers who are hiding in a cave.', 'Y', 'N', 7.8),
	('Inu Yasha', 'Kagome\'s Instinctive Choice', 6, 13, 'Yes', 'Yes', 'NA', 21, 6, 2006, 'Kagome must decide if she wants to save Kikyo, or not.', 'Y', 'N', 8),
	('Inu Yasha', 'Protect And Plunder!', 6, 14, 'Yes', 'Yes', 'NA', 28, 6, 2006, 'Princess Abi no longer wants to be in league with Naraku.', 'Y', 'N', 7.9),
	('Inu Yasha', 'The Cruel Reunion Of Fate', 6, 15, 'Yes', 'Yes', 'NA', 5, 7, 2006, 'Kohaku must kill the castle guards to retrieve the infant, Naraku\'s incarnation.', 'Y', 'N', 7.8),
	('Inu Yasha', 'The Demon Linked With The Netherworld', 6, 16, 'Yes', 'Yes', 'NA', 12, 7, 2006, 'After meeting Kikyo, Inuyasha and the gang rush to stop Naraku, who confronts Abi and her mother.', 'Y', 'N', 7.9),
	('Inu Yasha', 'The Demon Protector Of The Sacred Jewel Shard!', 6, 17, 'Yes', 'Yes', 'NA', 19, 7, 2006, 'Inuyasha and the gang follow Naraku. Before the group can confront their nemesis, Inuyasha must battle Hosenki, an old friend of Inuyasha\'s father.', 'Y', 'N', 6.9),
	('Inu Yasha', 'Final Battle At The Graveside! Sesshomaru Versus Inuyasha', 6, 18, 'Yes', 'Yes', 'NA', 26, 7, 2006, 'Naraku appears to steal Hosenki\'s shard, but Sesshomaru arrives on the scene, to everyone\'s surprise.', 'Y', 'N', 8.1),
	('Inu Yasha', 'Destroy Naraku With The Adamant Barrage!', 6, 19, 'Yes', 'Yes', 'NA', 2, 8, 2006, 'Sesshomaru faces off with Naraku, while Inuyasha tries to cut Hosenki\'s diamond body to gain a new power.', 'Y', 'N', 7.8),
	('Inu Yasha', 'Stampede Of The Countless Demon Rats!', 6, 20, 'Yes', 'Yes', 'NA', 12, 10, 2006, 'Naraku lets Hakudoshi employ a new method to bring Kikyo out of hiding--a tidal wave of endless demon rodents. Also, Kohaku finds himself in a dilemma.', 'Y', 'N', 6.6),
	('Inu Yasha', 'Kohaku\'s Decision And Sango\'s Heart', 6, 21, 'Yes', 'Yes', 'NA', 13, 10, 2006, 'Sango attempts to stop Kohaku and the demon rats, while Hakudoshi tries to subdue Kikyo\'s Mayose spell, intended to destroy the stampede of rodents.', 'Y', 'N', 7.4),
	('Inu Yasha', 'The Lucky But Two-Timing Scoundrel!', 6, 22, 'Yes', 'Yes', 'NA', 17, 10, 2006, 'Kagome returns home to get some rest without telling Inuyasha. Angrily he follows her and breaks her bike. Despite spending the day trying to fix it, Kagome is still furious and tells her friends he is cheating on her. Her friends then ask to meet him. How will this end for Kagome and Inuyasha?', 'Y', 'N', 7.5),
	('Inu Yasha', 'Miroku\'s Past Mistake', 6, 23, 'Yes', 'Yes', 'NA', 18, 10, 2006, 'Miroku is confronted by an old flame from his past, to Sango\'s chagrin.', 'Y', 'N', 7.4),
	('Inu Yasha', 'Forever With Lord Sesshomaru', 6, 24, 'Yes', 'Yes', 'NA', 19, 10, 2006, 'Rin has her doubts about whether or not she will be with Sesshomaru forever, after Jaken tells her that he and Sesshomaru will probably live longer than her, because she\'s mortal and they\'re demons.', 'Y', 'N', 7.2),
	('Inu Yasha', 'Kohaku, Sango And Kirara - The Secret Flower Garden', 6, 25, 'Yes', 'Yes', 'NA', 20, 10, 2006, 'Kirara recalls Sango and Kohaku\'s past, when they were children.', 'Y', 'N', 7.5),
	('Inu Yasha', 'Possessed By A Parasite - Shippo, Our Worst Enemy', 6, 26, 'Yes', 'Yes', 'NA', 24, 10, 2006, 'A parasite demon infects Shippo, causing him to attack his friends, but Inuyasha seems to be the Shippo\'s real target.', 'Y', 'N', 7.5),
	('Inu Yasha', 'The Ultimate Key To Defeating Naraku', 6, 27, 'Yes', 'Yes', 'NA', 25, 10, 2006, 'Naraku confronts Kikyo, while Hakudoshi creates a new monstrosity for Inuyasha and friends to deal with.', 'Y', 'N', 8),
	('Inu Yasha', 'The Bond Between Them, Use The Sacred Jewel Shard! - 1', 6, 28, 'Yes', 'Yes', 'NA', 26, 10, 2006, 'Inuyasha and the others find a strange man with demonic powers. Could this be the reincarnation of Naraku?', 'Y', 'N', 8.2),
	('Inu Yasha', 'The Bond Between Them, Use The Sacred Jewel Shard! - 2', 6, 29, 'Yes', 'Yes', 'NA', 27, 10, 2006, 'As Inuyasha and his team go after Kagura, they find a weakness which they plan to use to defeat their opponent, Naraku. Yet, Naraku has already taken steps to lead Inuyasha and his team into a terrible trap.', 'Y', 'N', 8.1),
	('Inu Yasha', 'Naraku\'s Heart', 7, 1, 'Yes', 'Yes', 'NA', 3, 10, 2009, 'Hakudoshi is scheming to take Naraku\'s place. He steals Kagome\'s Shikon Jewel shards and entices Kagura to betray Naraku.', 'Y', 'N', 8.5),
	('Inu Yasha', 'Kagura\'s Wind', 7, 2, 'Yes', 'Yes', 'NA', 10, 10, 2009, 'Upon healing her wounds inflicted by Naraku, using Midoriko\'s soul, Kikyo runs into Inuyasha again and reveals the secret to destroying Naraku.', 'Y', 'N', 8.9),
	('Inu Yasha', 'Meidou Zangetsuha', 7, 3, 'Yes', 'Yes', 'NA', 17, 10, 2009, 'It is the day of the annual Fox Demon Exam at the Demon Inn. Miroku and his friends get stuck taking the tests. Shippo hopes to be promoted in rank for playfully getting revenge on Inuyasha.', 'Y', 'N', 7.1),
	('Inu Yasha', 'Dragon-Scaled Tessaiga', 7, 4, 'Yes', 'Yes', 'NA', 24, 10, 2009, 'The swordsmith Toshu forges a demon-blade using one of Ryujin\'s scales, and the Dakki was born. Meanwhile, every time Inuyasha tries to attack, he is undermined by demonic energy. ', 'Y', 'N', 8),
	('Inu Yasha', 'Yorei Taisei\'s Trial', 7, 5, 'Yes', 'Yes', 'NA', 31, 10, 2009, 'The Tetsusaiga has attained the power of the dragon scales. In order to be able to quickly use the demonic power well, Inuyasha has no choice but to go through training.', 'Y', 'N', 8),
	('Inu Yasha', 'The End Of Moryomaru', 7, 6, 'Yes', 'Yes', 'NA', 7, 11, 2009, 'Inuyasha and Koga arrive at the scene of Moryomaru and Naraku\'s fight. But Moryomaru, who wants his Shikon shards, catches Koga.', 'Y', 'N', 8),
	('Inu Yasha', 'The Mausoleum Of Mount Azusa', 7, 7, 'Yes', 'Yes', 'NA', 14, 11, 2009, 'Kikyo has been contaminated by Naraku\'s spider web. In order to save her, Inuyasha and Kagome need the bowstring kept in Mount Azusa\'s mausoleum. ', 'Y', 'N', 7.3),
	('Inu Yasha', 'While The Stars Twinkle', 7, 8, 'Yes', 'Yes', 'NA', 21, 11, 2009, 'Kikyo attempts to purify Naraku and his Shikon shards along with Midoriko\'s will that controls the shards in Koga\'s legs.', 'Y', 'N', 8.2),
	('Inu Yasha', 'Sesshomaru In The Underworld', 7, 9, 'Yes', 'Yes', 'NA', 28, 11, 2009, 'Sesshomaru visits his mother to ask how he can expand the Tenseiga\'s Meido Zangetsuha technique. In response, his mother uses the Meido Stone that Sesshomaru\'s father gave her.', 'Y', 'N', 8.2),
	('Inu Yasha', 'Sorrow-Soaked Flowers', 7, 10, 'Yes', 'Yes', 'NA', 5, 12, 2009, 'The Flower Prince is a demon that feasts on saddened or anguished hearts. Dazzled by the flower\'s fragrance, Inuyasha becomes entangled in a fake dream.', 'Y', 'N', 7.5),
	('Inu Yasha', 'Kanna\'s Gravestone', 7, 11, 'Yes', 'Yes', 'NA', 12, 12, 2009, 'Inuyasha\'s party hides in a cave with a barrier, but the mirror demon finds them and breaks through it. As Inuyasha fights it, his body goes into demon form but Inuyasha somehow maintains control of his senses. As he wounds the demon, they are transferred to Kanna, who is controlling it. Watching from a safe place, Naraku orders her to keep the demon going until it kills them, or until their party kills her by killing the mirror demon. Inuyasha switches his target to the replica Tetsusaiga and successfully breaks it, which restores the power to his own sword and his body to his normal half-demon state. Kanna gets closer to the group, but Inuyasha refuses to kill her. Naraku makes Kanna and the mirror explode in a shower of glass shards in an attempt to wound the party. One shard of glass enters Kagome\'s eye. Through it, the dead Kanna gives her a clue as to how they can kill Naraku.', 'Y', 'N', 8.1),
	('Inu Yasha', 'Sango\'s Feelings, Miroku\'s Resolve', 7, 12, 'Yes', 'Yes', 'NA', 19, 12, 2009, 'During a new moon, Sango and Miroku face off against a \'Bone-collecting\' demon. During the battle, Miroku is forced to use his wind tunnel twice, resulting in his being poisoned. To protect him, Sango coats her hiraikotsu in poison and uses it to destroy the demon, destroying her weapon in the process. Myouga suggests they visit the Demon Master of Potions to have it repaired. The drunken man agrees to repair it and dumps it in a jug of alcohol, dissolving it. He sends Sango into another jug to pacify the demons inside. The demon\'s are the hiraikotsu which want Sango to promise not to \'betray\' them again, but she refuses, saying that as she loves Miroku, she would sacrifice her life for him. Outside the jar, the Master of Potions offers Miroku a poisonous drink that will prevent him from feeling the pain of any other poison or demon miasma, though it will not prevent it from actually reaching his heart. The hiraikotsu initially intend to kill Sango, but Miroku drinks the poison so he can continue to protect Sango. The hiraikotsu demons agree to fight with her again, and Sango\'s weapon is restored, more powerful than before.', 'Y', 'N', 7.9),
	('Inu Yasha', 'A Complete Meido', 7, 13, 'Yes', 'Yes', 'NA', 26, 12, 2009, 'The demon Shishinki approaches Sesshomaru for a fight, having been defeated by Sesshomaru\'s father long ago. To Sesshomaru\'s surprise, Shishinki attacks him using a complete Meido Zangetsuha and claims Sesshomaru\'s father stole the technique from him. Sesshomaru attacks with his Meido, but Shishinki\'s absorbs it. Inuyasha and his group arrive and after Shishinki attacks him, Inuyasha joins the argument. Shishinki taunts Sesshomaru, telling him that he must have been shunned by his father if his half-human brother has Tetsuiga as Tensaiga is just a cast off from it to contain the unneeded Meido. As Sesshomaru furiously wonders why his father did this, Shishinki attacks again. Inuyasha protects him with the Wind Scar, but Sesshomaru punches him and tells him not to interfere. Sesshomaru blindly charges Shishinki. Miroku uses a paper charm to fire Myoga at Inuyasha so he can explain to Sesshomaru that his father entrusted him with the Meido because he felt Sesshomaru could master it, however Shishinki points out that he could have just given him Tetsuiga instead of casting off Tenseiga. Sesshomaru resumes his attack. When Inuyasha again comes to his aid, their swords begin pulsating. When Sesshomaru draws Tenseiga, he is able to launch a massive complete Meido that swallows Shishinki. Inuyasha tries to tell Sesshomaru that Shishinki was lying, and that Tenseiga is a proper keepsake, but Sesshomaru states that they are destined to fight one another the rest of their lives. Myoga states Sesshomaru must have realized his father\'s true intentions.', 'Y', 'N', 8.2),
	('Inu Yasha', 'In Pursuit Of Naraku', 7, 14, 'Yes', 'Yes', 'NA', 4, 1, 2010, 'Sesshomaru visits Totosai, who confirms that his father gave him Tenseiga so Sesshomaru could perfect the Meido Zangetsuha before he planned Inu Yasha to reabsorb Tenseiga back into the Tetsusaiga. Meanwhile, Naraku begins pursuing Kohaku to retrieve his jewel shards, however Kohaku\'s shards are still being protected by Kikyo\'s powers and remain too pure for Naraku to easily get. Inuyasha\'s group arrives, and Naraku taunts Sango by saying Kohaku runs from her to forget his past. She states that she already knew that, but will still fight for him when he needs her. She attacks with Hiraikotsu and to her surprise, it now has its own demonic energy and it is able to injure Naraku. Inuyasha follows up with an Adamant Barrage attack, Kagome fires one of her arrows, and Miroku attempts to use his wind tunnel, but the injured Naraku manages to flee. Afterwards, Kohaku tells them that because his shards are still pure, they may be useable in the battle with Naraku. The injured Naraku orders Byakuya to give Sesshomaru a fragment of Kanna\'s mirror. In the end, Miroku examines that his miasma wound had spread due to using his wind tunnel while fighting.', 'Y', 'N', 7.6),
	('Inu Yasha', 'True Heir', 7, 15, 'Yes', 'Yes', 'NA', 11, 1, 2010, 'Seshomaru challanges Inuyasha in order to see if Inuyasha is worth having Tetsusaiga. He uses a fragment of Kanna\'s mirror to create a replica of the sword from Tenseiga. The fight between the two takes place in an uncertain place where Naraku sends them for the first part.The second part of the battle is taken inside a Meidou Sangetsuha created by Seshomaru and is rather between Inuyasha+Seshomaru against the sword that is now manipulated by Naraku. Inside the meidou Inuyasha mannages to defeat the meidou by using the dragon scaled Tetsuaiga to cut his own yuketsu. That convinces Seshomaru that he is the true heir of the sword and when Naraku attacks Inuyasha he decides to help him, but not directly. In the end Tetsuaiga gets the Meidou ability from Tenseiga and that is how Inuyasha and Seshomaru manage to exit the meidou. The episode ends with Seshomaru\'s group and Inuyasha\'s parting.', 'Y', 'N', 7.8),
	('Inu Yasha', 'Hitomiko\'s Barrier', 7, 16, 'Yes', 'Yes', 'NA', 18, 1, 2010, 'The priestess Hitomiko loses her life at Naraku\'s hands, but she is resurrected and locks Kagome within a barrier. Then, the true spiritual power of Mount Azusa\'s bow reveals itself!', 'Y', 'N', 7.5),
	('Inu Yasha', 'Magatsuhi\'s Evil Will', 7, 17, 'Yes', 'Yes', 'NA', 25, 1, 2010, 'Inuyasha\'s group returns to Kaede\'s village to tell her of Kikyo\'s death. As they talk, she states that Kagome\'s power was probably sealed by Magatsuhi, the evil will of the Shikon Jewel that did it out of fear of Kagome\'s powers. Meanwhile, Naraku enables Magatsuhi to manifest as a demon. With his new body, Magatsuhi attacks Sesshomaru\'s group to try to take Kohaku\'s shard. Sesshomaru struggles to defend the boy without a weapon and having only one arm. Inuyasha\'s group arrives to find Sesshomaru\'s right arm badly wounded and Kohaku\'s shard being defiled. As Inuyasha confronts Magatsuhi, he renders Kagome unconscious. Sesshomaru uses his will to heal his wounds, annoyed at Inuyasha\'s telling him to backdown, and assumes his true form to attack Magatsuhi. The brothers struggle to battle Magatsuhi, while protecting their respective groups. Eventually Magatsuhi spears Sesshomaru and traps him, saying he will be come part of Naraku\'s body. The others fear he is dead, and when Inuyasha rushes to free him he is captured as well. Sesshomaru bursts through the ball of appendages, and as Totosai arrives, Sesshomaru\'s left arm is restored and he is wielding a new sword. Totosai calls it Bakusaiga and says it was always inside Sesshomaru, but could not be wielded until he surpassed his father and learned let go of his obsession with Tetsusaiga. Kagome finally awakens.', 'Y', 'N', 8.6),
	('Inu Yasha', 'The Day Of Days', 7, 18, 'Yes', 'Yes', 'NA', 1, 2, 2010, 'Kohaku remains unconscious after being stared down by Magatsuhi, the evil will. Kagome is worried, but she has to buckle down and study for her entrance exams, so she decides to return home.', 'Y', 'N', 6.1),
	('Inu Yasha', 'Kohaku\'s Shard', 7, 19, 'Yes', 'Yes', 'NA', 8, 2, 2010, 'Sesshomaru chases after the evil will, Magatsuhi. But it\'s only part of a trap set up by Byakuya of the Dreams. Magatsuhi finds Kohaku lying unconscious, and he tries to deliver his Shikon shard to Naraku.', 'Y', 'N', 7.8),
	('Inu Yasha', 'When The Jewel Is Whole', 7, 20, 'Yes', 'Yes', 'NA', 15, 2, 2010, 'Kohaku successfully drives Magatsuhi out of his body just as Sesshomaru arrives, who manages to cut Magatsuhi in half, destroying part of him. Naraku then tries to take Kohaku\'s shard himself, but Sesshomaru attacks with his Bakusaiga, which causes Naraku\'s body to explode. Meanwhile, a red aura passes from Miroku\'s body into Rin\'s. Now possessed by Magatsuhi, Rin flies off with a demon. Later, Naraku manages to capture Kagome and demands Inuyasha\'s group give him Kohaku\'s shard in exchange for her. Kohaku spots a sacred arrow on the ground and hides it, before offering himself to Naraku. When Naraku grabs him, Kohaku stabs the arrow into the spot where Moryomaru\'s diamond armor is, shattering it. Naraku escapes in a miasma cloud. Sango and Kohaku hug one another in celebration, but then a piece of Naraku\'s flesh stabs Kohaku in the neck and takes the shard, leaving Kohaku\'s empty body behind. Naraku completes the Shikon Jewel, but Kohaku is brought back to life by Kikyo\'s light after he hears Sango crying for him.', 'Y', 'N', 8),
	('Inu Yasha', 'Inside Naraku', 7, 21, 'Yes', 'Yes', 'NA', 22, 2, 2010, 'Inuyasha\'s group leave to defeat Naraku, leaving Shippo behind. As they find Naraku and Byakuya in a cloud of miasma, they see Sesshomaru enter Naraku\'s body in search of Rin. As Inuyasha\'s group enters, Miroku pauses to propose to Sango. They soon realize that though they are breathing in the miasma, it is not harming them because the Shikon Jewel wants to capture their souls first. Kagome and Inuyasha search for the defiled jewel, after Miroku and Sango are captured. As Inuyasha gets closer to the jewel, he turns into a full-blooded demon and attacks Kagaome. Naraku offers Kagome a miasma-coated arrow to save herself with, but she refuses. Inuyasha attacks again, throwing her off a cliff. Naraku says Inuyasha will kill her, just as he killed Kikyo. ', 'Y', 'N', 7.3),
	('Inu Yasha', 'Naraku - Trap Of Darkness', 7, 22, 'Yes', 'Yes', 'NA', 1, 3, 2010, 'Inuyasha\'s heart is devoured by the Shikon Jewel\'s poison, and he turns into his demon form helpless as the darkness in his heart takes control of him.', 'Y', 'N', 7.5),
	('Inu Yasha', 'Naraku - Trap Of Light', 7, 23, 'Yes', 'Yes', 'NA', 8, 3, 2010, 'Kagome\'s spiritual powers are restored, and divine light is revived in Naraku\'s Shikon Jewel. However, Naraku uses this as a decoy to lure Sango into his trap.', 'Y', 'N', 7.7),
	('Inu Yasha', 'Naraku\'s Uncertain Wish', 7, 24, 'Yes', 'Yes', 'NA', 15, 3, 2010, 'Naraku has been living as a demon despite having a human heart. While fighting him, Kagome asks about his true wish.', 'Y', 'N', 7.9),
	('Inu Yasha', 'Thoughts Fall Short', 7, 25, 'Yes', 'Yes', 'NA', 21, 3, 2010, 'Naraku heads for the Bone Eater\'s Well and vanishes! Before disappearing, Naraku makes his last wish for Kagome, injured at the hands of Byakuya, to be swallowed into Meido, the Path to the Underworld.', 'Y', 'N', 7.9),
	('Inu Yasha', 'Towards Tomorrow', 7, 26, 'Yes', 'Yes', 'NA', 28, 3, 2010, 'When the last person to obtain the Shikon Jewel makes the one correct wish, the jewel will be purified and disappear entirely from this world. The long journey of Inuyasha and his companions comes to end and thus concludes this Feudal Fairy Tale.', 'Y', 'N', 7.8),
	('Last Week Tonight With John Oliver', 'India Elections', 1, 1, 'Yes', 'Yes', 'NA', 27, 4, 2014, 'John talks about the rise of the far-right political parties in Europe, the Ukrainian election, Afghanistan, Net Neutrality, Australia\'s hard-line right-wing Prime Minister Tony Abbott and the 2014 Scripps National Spelling Bee.', 'Y', 'N', 8.7),
