	('Last Week Tonight With John Oliver', 'Police Militarization', 1, 15, 'Yes', 'Yes', 'NA', 17, 8, 2014, 'John talks about the conflict in Ferguson, MO and the wage gap between the genders.', 'Y', 'N', 8.1),
	('Last Week Tonight With John Oliver', 'Student Debt', 1, 16, 'Yes', 'Yes', 'NA', 7, 9, 2014, 'John talks about ISIS and student loan debt. Musical group A Great Big World make a special appearance.', 'Y', 'N', 8.1),
	('Last Week Tonight With John Oliver', 'Scotish Independence', 1, 17, 'Yes', 'Yes', 'NA', 14, 9, 2014, 'John talks about the NFL\'s decision on Ray Rice\'s contract, the international response to ISIS, Scotland\'s separation from the United Kingdom and Twitter hashtags that are being misused by corporations.', 'Y', 'N', 8.2),
	('Last Week Tonight With John Oliver', 'Beauty Pageants', 1, 18, 'Yes', 'Yes', 'NA', 21, 9, 2014, 'John Oliver talks about a Russian submarine in Sweden, Ebola in New York, added sugar in food, Rob Ford\'s brother, and interviews Jane Goodall.', 'Y', 'N', 8.4),
	('Last Week Tonight With John Oliver', 'Drones', 1, 19, 'Yes', 'Yes', 'NA', 28, 9, 2014, 'While midterm coverage is largely focused on the parts of Congress that do very little, vital (and bizarre) midterm elections are going unexamined. State legislators pass a lot of bills, and some of that efficiency is thanks to a group called ALEC that writes legislation for them. It\'s as shady as it sounds!', 'Y', 'N', 8.1),
	('Last Week Tonight With John Oliver', 'Police', 1, 20, 'Yes', 'Yes', 'NA', 5, 10, 2014, 'Did you know police can just take your stuff if they suspect it\'s involved in a crime? They can! It\'s a shady process called civil asset forfeiture,and it would make for a weird episode of Law and Order.', 'Y', 'N', 8.8),
	('Last Week Tonight With John Oliver', 'Translators', 1, 21, 'Yes', 'Yes', 'NA', 19, 10, 2014, 'Pharmaceutical companies spend billions of dollars marketing drugs to doctors. We have a few issues with that. RadioShack has filed for bankruptcy. We\'ve helped them create a farewell message. Ecuadorian President Rafael Correa.', 'Y', 'N', 8.5),
	('Last Week Tonight With John Oliver', 'Sugar', 1, 22, 'Yes', 'Yes', 'NA', 26, 10, 2014, 'Thanks to tobacco industry regulations and marketing restrictions in the US, smoking rates have dropped dramatically. John Oliver explains how tobacco companies are keeping their business strong overseas. We\'ve noticed that the Sports Illustrated Swimsuit Issue still exists but can\'t quite figure out why.', 'Y', 'N', 8.1),
	('Last Week Tonight With John Oliver', 'State Legislatures', 1, 23, 'Yes', 'Yes', 'NA', 2, 11, 2014, 'The vast majority of US judges are elected, forcing many judges to pander to the electorate and accept campaign money in order to keep their jobs. This seems slightly troubling... The UK\'s Labour Party has painted a campaign van pink in an attempt to attract women voters. We are glad they didn\'t keep going with that strategy.', 'Y', 'N', 8.2),
	('Last Week Tonight With John Oliver', 'Lottery', 1, 24, 'Yes', 'Yes', 'NA', 9, 11, 2014, 'America\'s crumbling infrastructure: It\'s not a sexy problem, but it is a scary one.', 'Y', 'N', 8.8),
	('Last Week Tonight With John Oliver', 'Marketing To Doctors', 2, 1, 'Yes', 'Yes', 'NA', 8, 2, 2015, 'Pharmaceutical companies spend billions of dollars marketing drugs to doctors. We have a few issues with that. RadioShack has filed for bankruptcy. We\'ve helped them create a farewell message. Ecuadorian President Rafael Correa.', 'Y', 'N', 8.5),
	('Last Week Tonight With John Oliver', 'Tobacco', 2, 2, 'Yes', 'Yes', 'NA', 15, 2, 2015, 'Thanks to tobacco industry regulations and marketing restrictions in the US, smoking rates have dropped dramatically. John Oliver explains how tobacco companies are keeping their business strong overseas. We\'ve noticed that the Sports Illustrated Swimsuit Issue still exists but can\'t quite figure out why.', 'Y', 'N', 9),
	('Last Week Tonight With John Oliver', 'Elected Judges', 2, 3, 'Yes', 'Yes', 'NA', 22, 2, 2015, 'The vast majority of US judges are elected, forcing many judges to pander to the electorate and accept campaign money in order to keep their jobs. This seems slightly troubling... The UK\'s Labour Party has painted a campaign van pink in an attempt to attract women voters. We are glad they didn\'t keep going with that strategy.', 'Y', 'N', 8.3),
	('Last Week Tonight With John Oliver', 'Infrastructure', 2, 4, 'Yes', 'Yes', 'NA', 1, 3, 2015, 'America\'s crumbling infrastructure: It\'s not a sexy problem, but it is a scary one.', 'Y', 'N', 8.4),
	('Last Week Tonight With John Oliver', 'Territories', 2, 5, 'Yes', 'Yes', 'NA', 8, 3, 2015, 'A set of Supreme Court decisions made over 100 years ago has left U.S. territories without meaningful representation. That\'s weird, right? Daylight saving time doesn\'t actually benefit anyone. Strangely, it\'s still a thing!', 'Y', 'N', 8.5),
	('Last Week Tonight With John Oliver', 'NCAA', 2, 6, 'Yes', 'Yes', 'NA', 15, 3, 2015, 'The NCAA doesn\'t pay athletes because they consider them amateurs. The NCAA considers them amateurs because they don\'t get paid.', 'Y', 'N', 8.4),
	('Last Week Tonight With John Oliver', 'Municipal Violations', 2, 7, 'Yes', 'Yes', 'NA', 22, 3, 2015, 'If you have money, committing a municipal violation may pose you a minor inconvenience. If you don\'t, it can ruin your life. The New Hampshire legislature refused to make the red-tailed hawk the official raptor of their state...so we made it the official raptor of our show.', 'Y', 'N', 8.3),
	('Last Week Tonight With John Oliver', 'Surveillance', 2, 8, 'Yes', 'Yes', 'NA', 5, 4, 2015, 'There are very few government checks on what America\'s sweeping surveillance programs are capable of doing. John Oliver sits down with Edward Snowden to discuss the NSA, the balance between privacy and security, and dick-pics.', 'Y', 'N', 9.6),
	('Last Week Tonight With John Oliver', 'IRS', 2, 9, 'Yes', 'Yes', 'NA', 12, 4, 2015, 'Nobody likes the IRS. But recent budget and staff cuts have made it increasingly difficult for the department to do its very important job. Don\'t take our word for it. Ask Michael Bolton.', 'Y', 'N', 7.7),
	('Last Week Tonight With John Oliver', 'Patents', 2, 10, 'Yes', 'Yes', 'NA', 19, 4, 2015, 'For inventors, patents are an essential protection against theft. But when patent trolls abuse the system by stockpiling patents and threatening lawsuits, businesses are forced to shell out tons of money. CNN produced an actual doomsday video to broadcast when the world is ending and its incredibly dull. We\'ve enlisted Martin Sheen to help make humanitys final moments happier!', 'Y', 'N', 8.1),
	('Last Week Tonight With John Oliver', 'Fashion', 2, 11, 'Yes', 'Yes', 'NA', 26, 4, 2015, 'Trendy clothes are cheaper than ever. That sounds great for the people who buy them, but it\'s horrible for the people who make them.', 'Y', 'N', 8.3),
	('Last Week Tonight With John Oliver', 'Standardized Testing', 2, 12, 'Yes', 'Yes', 'NA', 3, 5, 2015, 'American students face a ridiculous amount of testing. John Oliver explains how standardized tests impact school funding, the achievement gap, how often kids are expected to throw up.', 'Y', 'N', 8.1),
	('Last Week Tonight With John Oliver', 'Paid Family Leave', 2, 13, 'Yes', 'Yes', 'NA', 10, 5, 2015, 'Many American companies do not offer paid leave after the birth of a child, which means they probably shouldn\'t run sappy Mother\'s Day ads.', 'Y', 'N', 8.3),
	('Last Week Tonight With John Oliver', 'Chickens', 2, 14, 'Yes', 'Yes', 'NA', 17, 5, 2015, 'John Oliver explains how chicken farming can be unfair, punishing, and inhumane. And not just for the chickens!', 'Y', 'N', 8.2),
	('Last Week Tonight With John Oliver', 'FIFA', 2, 15, 'Yes', 'Yes', 'NA', 31, 5, 2015, 'After the arrests of numerous top officials, John Oliver decided to give an update on the state of FIFA.', 'Y', 'N', 8.9),
	('Last Week Tonight With John Oliver', 'Bail', 2, 16, 'Yes', 'Yes', 'NA', 7, 6, 2015, 'John Oliver explains why America\'s bail system is better for the reality tv industry than it is for the justice system.', 'Y', 'N', 8.5),
	('Last Week Tonight With John Oliver', 'Torture', 2, 17, 'Yes', 'Yes', 'NA', 14, 6, 2015, 'The US Senate Torture Report revealed horrifying details of America\'s interrogation program. Helen Mirren will fill you in.', 'Y', 'N', 8.6),
	('Last Week Tonight With John Oliver', 'The Internet', 2, 18, 'Yes', 'Yes', 'NA', 21, 6, 2015, 'Online harassment is a major problem, but it\'s rarely prosecuted. If only we been warned about this in the early days of the internet.', 'Y', 'N', 8.3),
	('Last Week Tonight With John Oliver', 'Transgender Rights', 2, 19, 'Yes', 'Yes', 'NA', 28, 6, 2015, 'This week\'s gay rights victory was historic, but the transgender community still faces staggering challenges. John Oliver focuses on the \'T\' in \'LGBT\'', 'Y', 'N', 8.3),
	('Last Week Tonight With John Oliver', 'Stadiums', 2, 20, 'Yes', 'Yes', 'NA', 12, 7, 2015, 'Cities spend massive amounts of public money on privately-owned stadiums. Cities issue tax-exempt municipal bonds that - wait, don\'t fall asleep!', 'Y', 'N', 8.4),
	('Last Week Tonight With John Oliver', 'Food Waste', 2, 21, 'Yes', 'Yes', 'NA', 19, 7, 2015, 'Producers, sellers, and consumers waste tons of food. John Oliver discusses the shocking amount of food we don\'t eat.', 'Y', 'N', 8.7),
	('Last Week Tonight With John Oliver', 'Mandatory Minimums', 2, 22, 'Yes', 'Yes', 'NA', 26, 7, 2015, 'Mandatory minimums require fixed prison sentences for certain crimes. John Oliver explains why we treat some turkeys better than most low-level offenders.', 'Y', 'N', 8.7),
	('Last Week Tonight With John Oliver', 'District Of Columbia', 2, 23, 'Yes', 'Yes', 'NA', 2, 8, 2015, 'Washington DC experiences taxation without representation. It\'s also missing from rhyming state songs. John Oliver and a group of singing children fix one of these problems.', 'Y', 'N', 8.4),
	('Last Week Tonight With John Oliver', 'Sex Ed', 2, 24, 'Yes', 'Yes', 'NA', 9, 8, 2015, 'Sex education varies widely between school districts, leaving many teens without comprehensive information. We made a video that covers what some schools are too embarrassed to teach.', 'Y', 'N', 9.1),
	('Last Week Tonight With John Oliver', 'Church', 2, 25, 'Yes', 'Yes', 'NA', 16, 8, 2015, 'U.S. tax law allows television preachers to get away with almost anything. We know this from personal experience.', 'Y', 'N', 9.4),
	('Last Week Tonight With John Oliver', 'LGBT Discrimination', 2, 26, 'Yes', 'Yes', 'NA', 23, 8, 2015, 'This year\'s gay marriage ruling was a milestone, but LGBT discrimination is still surprisingly legal. John Oliver explains why we need a federal anti-discrimination law.', 'Y', 'N', 8.4),
	('Last Week Tonight With John Oliver', 'Public Defenders', 2, 27, 'Yes', 'Yes', 'NA', 13, 9, 2015, 'The Miranda warning includes the right to a public defender. It doesn\'t include the fact that public defenders are highly overworked and grossly underpaid.', 'Y', 'N', 8.6),
	('Last Week Tonight With John Oliver', 'Europe', 2, 28, 'Yes', 'Yes', 'NA', 27, 9, 2015, 'The European migrant crisis sees millions of refugees face hostility, racism, and red tape so John Oliver does something small for them. In other news Pope Francis visited the U.S., an interesting report on David Cameron and the Volkswagen emissions scandal.', 'Y', 'N', 8.3),
	('Last Week Tonight With John Oliver', 'Mental Health', 2, 29, 'Yes', 'Yes', 'NA', 4, 10, 2015, 'John Oliver investigates the treatment of mental health in the US and discovers the system doesn\'t always work. In other news Russia gets involved in the bombing of Syria, the UN trains the leaders of the future and Jason Chaffetz is embarressed. John Oliver also launches a brand new app.', 'Y', 'N', 8.2),
	('Last Week Tonight With John Oliver', 'North Dakota', 2, 30, 'Yes', 'Yes', 'NA', 11, 10, 2015, 'North Dakota\'s reputation for politeness has led to oil companies taking advantage so John Oliver offers the people of the \'legendary\' state a solution. In other news the war in Syria rages on, FIFA is still rife with corruption and Toyota are asked to explain why ISIS has so many of their vehicles.', 'Y', 'N', 8.1),
	('Last Week Tonight With John Oliver', 'Canada', 2, 31, 'Yes', 'Yes', 'NA', 18, 10, 2015, 'In order to help Canada with their upcoming election, John Oliver enlists Mike Myers, a beaver, and a moose to give some advice to voters. In other news the New Zealand Prime Minister admits to some interesting habits, Mexico isn\'t happy with it\'s president and a zoo in Denmark tries to educate visitors by butchering animals.', 'Y', 'N', 8.3),
	('Last Week Tonight With John Oliver', 'Elections', 2, 32, 'Yes', 'Yes', 'NA', 1, 11, 2015, 'John Oliver discusses the impact of the upcoming US elections on the status of Medicaid and tries to calm tensions in the East China Sea through Kenny G. In other news the peace talks in Syria feature no Syrians, the link between the Ukraine and Star Wars, and Andrew Lloyd Webber has some opinions on UK tax credits.', 'Y', 'N', 7.9),
	('Last Week Tonight With John Oliver', 'Prisoner Re-entry', 2, 33, 'Yes', 'Yes', 'NA', 8, 11, 2015, 'John Oliver explains the hurdles for prisoner re-entry in the US with help from a real life ex-convict. In other news, the UK introduces new surveillance measures, US patriotism is an advertising gimmick, and the Washington Redskins defend their trademark.', 'Y', 'N', 8.3),
	('Last Week Tonight With John Oliver', 'Daily Fantasy', 2, 34, 'Yes', 'Yes', 'NA', 15, 11, 2015, 'John Oliver investigates the murky world of Daily Fantasy Sports and creates an advertisement to help explain the positives. In other news, the terrorist attacks in Paris shocked the world, Singles Day in China features some questionable celebrity endorsements, and India want their diamond back.', 'Y', 'N', 8.3),
	('Last Week Tonight With John Oliver', 'Pennies', 2, 35, 'Yes', 'Yes', 'NA', 22, 11, 2015, 'John Oliver starts a campaign to remove the penny from circulation and takes a look back at the highlights of the season with appearances from some of our favorite characters. The Paris attacks and their impact on refugee intake across the globe are also discussed.', 'Y', 'N', 8.6),
	('Last Week Tonight With John Oliver', 'Voting', 3, 1, 'Yes', 'Yes', 'NA', 14, 2, 2016, 'John talks about Scalia\'s love of the Letter of the Law, Chipotle\'s avian mascot, and how Voter ID laws should be applied to those who write them.', 'Y', 'N', 8.2),
	('Last Week Tonight With John Oliver', 'Abortion Law', 3, 2, 'Yes', 'Yes', 'NA', 21, 2, 2016, 'Abortion is theoretically legal, but some states make it practically inaccessible. And how is Hollywood whitewashing still a thing?', 'Y', 'N', 8.6),
	('Last Week Tonight With John Oliver', 'Trump', 3, 3, 'Yes', 'Yes', 'NA', 28, 2, 2016, 'Our main story was about Donald Trump. We can\'t believe we\'re saying that either.', 'Y', 'N', 9.3),
	('Last Week Tonight With John Oliver', 'Special Districts', 3, 4, 'Yes', 'Yes', 'NA', 6, 3, 2016, 'Special districts spend more public money than all city governments combined. That\'s odd considering most of us don\'t know they exist.', 'Y', 'N', 7.7),
	('Last Week Tonight With John Oliver', 'Encryption', 3, 5, 'Yes', 'Yes', 'NA', 13, 3, 2016, 'Strong encryption poses problems for law enforcement, is weakening it worth the risks it presents? Itscomplicated.', 'Y', 'N', 8.2),
	('Last Week Tonight With John Oliver', 'The Wall', 3, 6, 'Yes', 'Yes', 'NA', 20, 3, 2016, 'Donald Trumpf wants to build a wall on the U.S.-Mexico border. Is his plan feasible?', 'Y', 'N', 8.4),
	('Last Week Tonight With John Oliver', 'Congressional Fundraising', 3, 7, 'Yes', 'Yes', 'NA', 3, 4, 2016, 'Lawmakers have to raise money to keep their jobs, but a surprising amount of their job now consists of raising money. John Oliver sits down with Congressman Steve Israel to discuss the costs of political spending.', 'Y', 'N', 7.7),
	('Last Week Tonight With John Oliver', 'Credit Reports', 3, 8, 'Yes', 'Yes', 'NA', 10, 4, 2016, 'Credit reports play a surprisingly large role in our lives, but even more surprising is how often they contain critical mistakes. John Oliver helps credit agencies see why this is a problem.', 'Y', 'N', 8),
	('Last Week Tonight With John Oliver', 'Lead', 3, 9, 'Yes', 'Yes', 'NA', 17, 4, 2016, 'Lead poisoning is a national problem. If only lawmakers were as concerned as the puppets on Sesame Street.', 'Y', 'N', 7.7),
