	('Last Week Tonight With John Oliver', 'Scientific Studies', 3, 11, 'Yes', 'Yes', 'NA', 8, 5, 2016, 'John Oliver on Sticking to the Facts: Media outlets often report new findings from scientific studies, but how many are true?', 'Y', 'N', 8.7),
	('Last Week Tonight With John Oliver', '911', 3, 12, 'Yes', 'Yes', 'NA', 15, 5, 2016, 'John Oliver on 911 Reliability: Things you never want to hear: there are no guarantees when you call 911. Emergency call centers are in desperate need of funding and new technology, so no guarantees is the unfortunate reality.', 'Y', 'N', 8),
	('Last Week Tonight With John Oliver', 'Primaries And Caucuses', 3, 13, 'Yes', 'Yes', 'NA', 22, 5, 2016, 'Last Week Tonight Tackles U.S. Primaries and Caucuses: The United States selection process for presidential nominees is convoluted  to say the least. Nevertheless, John Oliver reminds Americans that the \'middle of the game\' is the worst possible time to change the rules.', 'Y', 'N', 7.9),
	('Last Week Tonight With John Oliver', 'Debt Buyers', 3, 14, 'Yes', 'Yes', 'NA', 5, 6, 2016, 'John Oliver Takes On Debt Buyers: Companies that purchase debt on the cheap will aggressively collect on it. \'Last Week Tonight took a hands-on approach to addressing this issue.', 'Y', 'N', 8.5),
	('Last Week Tonight With John Oliver', 'Retirement Plans', 3, 15, 'Yes', 'Yes', 'NA', 12, 6, 2016, 'John Oliver Covers Ins and Outs of Retirement Plans: Saving for retirement means navigating a potential minefield of high fees and bad advice - Last Week Tonight is here to help.', 'Y', 'N', 8.1),
	('Last Week Tonight With John Oliver', 'Brexit', 3, 16, 'Yes', 'Yes', 'NA', 19, 6, 2016, 'John Oliver on Brexiting from the EU: There might be an innate British desire to diss Europe, but Last Week Tonight lays out exactly why its a mistake to leave the EU.', 'Y', 'N', 8.1),
