	('Last Week Tonight With John Oliver', 'Journalism', 3, 20, 'Yes', 'Yes', 'NA', 7, 8, 2016, 'Last Week Tonight on the Decline of Journalism. John Oliver has some bad news about the state of the industry that gives us our news.', 'Y', 'N', 8.3),
