	('Legends Of The Hidden Temple', 'The Smashed Printing Plate Of Frederick Douglass', 3, 35, 'No', 'Yes', 'NA', 11, 4, 1995, 'Red Jaguars, Blue Barracudas, Purple Parrots and Silver Snakes had make it through the mote. Red Jaguars and Purple Parrots pass the Steps of Knowledge. The winner of The Temple Games is the Red Jaguars who end up losing the 3-minutes round in The Temple.', 'N', 'N', 0),
	('Legends Of The Hidden Temple', 'The Snow Cone Of Mount Kilimanjaro', 3, 36, 'No', 'Yes', 'NA', 25, 4, 1995, 'Red Jaguars, Orange Iguanas, Purple Parrots and Silver Snakes had make it through the mote. Red Jaguars and Silver Snakes pass the Steps of Knowledge. The winner of The Temple Games is the Silver Snakes who end up losing the 3-minutes round in The Temple.', 'N', 'N', 0),
	('Legends Of The Hidden Temple', 'The Thornwood Gavel Of Judge Roy Bean', 3, 37, 'No', 'Yes', 'NA', 2, 5, 1995, 'Red Jaguars, Green Monkeys, Orange Iguanas and Silver Snakes had make it through the mote. Green Monkeys and Orange Iguanas pass the Steps of Knowledge. The winner of The Temple Games is the Orange Iguanas who end up losing the 3-minutes round in The Temple.', 'N', 'N', 0),
	('Legends Of The Hidden Temple', 'The Upside-Down Compass Of Henry Hudson', 3, 38, 'No', 'Yes', 'NA', 23, 5, 1995, 'Red Jaguars, Green Monkeys, Purple Parrots and Silver Snakes had make it through the mote. Green Monkeys and Purple Parrots pass the Steps of Knowledge. The winner of The Temple Games is the Purple Parrots who end up losing the 3-minutes round in The Temple.', 'N', 'N', 0),
	('Legends Of The Hidden Temple', 'The Useless Map Of The Chibcha Chieftain', 3, 39, 'No', 'Yes', 'NA', 20, 6, 1995, 'Green Monkeys, Orange Iguanas, Purple Parrots and Silver Snakes had make it through the mote. Orange Iguanas and Silver Snakes pass the Steps of Knowledge. The winner of The Temple Games is the Orange Iguanas who end up losing the 3-minutes round in The Temple.', 'N', 'N', 0),
	('Legends Of The Hidden Temple', 'The War Fan Of The 47 Ronin', 3, 40, 'No', 'Yes', 'NA', 27, 6, 1995, 'Red Jaguars, Blue Barracudas, Green Monkeys and Silver Snakes had make it through the mote. Red Jaguars and Silver Snakes pass the Steps of Knowledge. The winner of The Temple Games is the Silver Snakes who end up losing the 3-minutes round in The Temple.', 'N', 'N', 0),
	('Lie To Me', 'Pilot', 1, 1, 'Yes', 'Yes', 'Yes', 21, 1, 2009, 'A teen from a devoutly religious family is accused of murdering his teacher. The DA wants to try him as an adult, but before the mayor will endorse it, he wants Cal and Gillian to determine if the teen shows signs of guilt. Meanwhile, Cal and Gillian seek out Ria Torres, a young woman with a natural ability to read people. Gillian and new recruit Ria are hired by the Democratic National Committee to interview the Chairman of the House Ethics Committee after he\'s accused of paying for sex.', 'Y', 'N', 8.3),
	('Lie To Me', 'Moral Waiver', 1, 2, 'Yes', 'Yes', 'Yes', 28, 1, 2009, 'Cal and Ria interview a female soldier to determine if there\'s any truth to her accusation of her platoon leader for sexual assault. Meanwhile, Gillian and Eli are hired by the Athletic Association to determine if a high-profile basketball recruit accepted a payoff to play for his university.', 'Y', 'N', 7.7),
	('Lie To Me', 'A Perfect Score', 1, 3, 'Yes', 'Yes', 'Yes', 4, 2, 2009, 'Cal and Ria are brought in to determine if a federal judge is involved in the murder of her teenage daughter, and the investigation leads them to a highly competitive college-prep school where getting to the head of the class means everything. Meanwhile, Gillian and Eli interview a pilot for NASA, who thinks he may have intentionally crashed an aircraft worth a quarter of a billion dollars. Also, Cal must deal with a personal incident involving his young teenage daughter, Emily.', 'Y', 'N', 7.8),
	('Lie To Me', 'Love Always', 1, 4, 'Yes', 'Yes', 'Yes', 18, 2, 2009, 'The government hired the Lightman Group after receiving information about an assassination plot to be carried out at the upcoming wedding of the son of a controversial South Korean ambassador. The team works together in an effort to identify the would-be assassin before anyone is hurt. During the course of the job, they uncover a few secrets the family would rather keep buried.', 'Y', 'N', 7.8),
	('Lie To Me', 'Unchained', 1, 5, 'Yes', 'Yes', 'Yes', 4, 3, 2009, 'The Governor is considering a pardon for a notorious gang leader who\'s up for a Nobel Prize for the anti-gang work he\'s done while in prison. He wants Cal and Ria to assess whether the prisoner has truly been rehabilitated and will continue his work on the outside, like he promises. An autopsy reveals a firefighter who died in a fire was already dead. The National Fire Safety Board hires Gillian and Eli to interview the other firefighters to find out what really happened.', 'Y', 'N', 8),
	('Lie To Me', 'Do No Harm', 1, 6, 'Yes', 'Yes', 'Yes', 11, 3, 2009, 'The parents of an abducted girl receive dozens of tips after offering a hefty reward for information. Cal and Gillian help them identify which tips are legitimate. The job hits close to home for Gillian who shares some personal details about her past. A publisher hires Ria and Eli to determine if a renowned peace activist is really who she claims to be after rumors surface, challenging her story; Eli\'s attraction to the subject begins to cloud his judgment, though.', 'Y', 'N', 7.9),
	('Lie To Me', 'The Best Policy', 1, 7, 'Yes', 'Yes', 'Yes', 18, 3, 2009, 'An old friend asks Cal to look into the theft of the formula for a new drug after a knockoff surfaces and causes three deaths. He and Ria discover there\'s much more to the story. Meanwhile, Gillian and Eli help the U.S. government negotiate with Yemen for the release of two Americans about to be executed for possession of marijuana and uncover something the government is trying to hide.', 'Y', 'N', 7.8),
	('Lie To Me', 'Depraved Heart', 1, 8, 'Yes', 'Yes', 'Yes', 1, 4, 2009, 'Cal becomes obsessed when he learns three young women from India committed suicide within the same week. Ria assists the investigation and uncovers a painful incident from his past. Meanwhile, Gillian and Eli help the SEC try to recover millions of dollars from a man accused of scamming his investors. Just as they\'re making progress, they disagree on how to proceed and Eli takes matters into his own hands. When confronted by Gillian, he takes muscle relaxants to help him successfully lie and then selfishly eases his conscience by confessing his indiscretion to Ria.', 'Y', 'N', 8),
	('Lie To Me', 'Life Is Priceless', 1, 9, 'Yes', 'Yes', 'Yes', 8, 4, 2009, 'Cal and Gillian assist FEMA in their investigation of a building collapse and uncover a massive cover-up. Meanwhile, a billionaire asks Ria and Eli to determine if his girlfriend loves him for the right reasons before he proposes. They see the job as \'snooping\' and decline, but reconsider after the client pays them a hefty fee.', 'Y', 'N', 7.8),
	('Lie To Me', 'Better Half', 1, 10, 'Yes', 'Yes', 'Yes', 22, 4, 2009, 'Zoe Landau, an attorney for the Department of Justice and Cal\'s ex-wife, asks for help on an arson investigation that resulted in death. Cal, Gillian, and Eli uncover a few secrets along with the very surprising culprit. Meanwhile, Gillian, Ria, and Eli help a detective get to the truth behind the murder of a member of a rapper\'s entourage, also uncovering a few surprising secrets.', 'Y', 'N', 7.8),
	('Lie To Me', 'Undercover', 1, 11, 'Yes', 'Yes', 'Yes', 29, 4, 2009, 'Cal, Ria and Gillian are brought in to assess the truthfulness of two cops who shot a teenager. The case takes a strange turn involving an FBI undercover investigation into a terrorist threat. Meanwhile, the Lightman Group is being sued by the investors from the multimillion dollar scam Gillian and Eli worked on earlier, but it\'s not as it looks. The lie Eli told Gillian comes out, which ends negatively for him.', 'Y', 'N', 7.9),
	('Lie To Me', 'Blinded', 1, 12, 'Yes', 'Yes', 'Yes', 6, 5, 2009, 'A copycat rapist has just abducted another woman. FBI Special Agent Ben Reynolds sends Cal undercover to obtain any information he can from Andrew Jenkins, the serial rapist the copycat is emulating. Jenkins, a twisted evil genius, just toys with Cal, giving them little to work with. The team is left racing against the clock to uncover the copycat\'s identity and figure out where he\'s taken his victim.', 'Y', 'N', 8.9),
	('Lie To Me', 'Sacrifice', 1, 13, 'Yes', 'Yes', 'Yes', 13, 5, 2009, 'Domestic terrorist bombings in Washington, DC sends everyone into a panic. The Lightman Group is brought in to help identify who is responsible. They manage to trace the bombings to two young men of Middle Eastern descent, but must reassess their findings when neither boy has any history of radical behavior. The case gets personal when Cal learns Ria\'s boyfriend was in the vicinity of one of the bombings and is now missing. He decides to withhold the information from Ria so she can stay focused on the case, and when she discovers he held back, she goes ballistic.', 'Y', 'N', 8.2),
	('Lie To Me', 'The Core Of It', 2, 1, 'Yes', 'Yes', 'Yes', 28, 9, 2009, 'Cal is approached by a young woman who claims she saw a murder in a vision, but the police won\'t believe her. He and Gillian quickly discover there\'s much more to her story. Meanwhile, Ria interviews a Supreme Court nominee for the White House to determine if there are any skeletons in his closet. Also, Zoe surprises Cal with an announcement -- she\'s quit the DOJ and going into private practice... in Chicago.', 'Y', 'N', 8.3),
	('Lie To Me', 'Truth Or Consequences', 2, 2, 'Yes', 'Yes', 'Yes', 5, 10, 2009, 'Zoe enlists Cal and Ria to help prove that her client, a 22-year old college boy charged with statutory rape, had no idea the girl was only 16. When a video of the sexual encounter surfaces on the internet, it eventually leads them to the truth; something her father has trouble accepting. Meanwhile, a self-proclaimed prophet claims his group is a religion and not subject to taxation, but the IRS thinks they\'re frauds and hire Gillian and Eli to investigate. Gillian stirs up trouble when she goes out on a limb to help a woman and her three kids escape after the woman confides that she\'s being forced to stay against her will.', 'Y', 'N', 8.1),
	('Lie To Me', 'Control Factor', 2, 3, 'Yes', 'Yes', 'Yes', 12, 10, 2009, 'A man from the American Embassy in Mexico, concerned about a coverup when local police refuse to investigate the disappearance of an American woman, asks Cal, who\'s there on vacation, to look into it. Getting no cooperation from witnesses or police, Cal sends for Ria to help uncover what everyone is hiding. Meanwhile, Cal\'s rival, Jack Rader, works with Gillian to identify the person responsible for tainting the blood from the blood bank when patients receiving transfusions become seriously ill and one dies.', 'Y', 'N', 8),
	('Lie To Me', 'Honey', 2, 4, 'Yes', 'Yes', 'Yes', 19, 10, 2009, 'Emotions run high when Eric Matheson, accused of murdering his wife, takes the Lightman Group hostage. Cal can see that Eric is telling the truth when he swears he didn\'t do it and, agreeing to remain behind as his hostage, Cal convinces Eric to let the rest of the team go so they can figure out who\'s responsible for his wife\'s death.', 'Y', 'N', 8.2),
	('Lie To Me', 'Grievous Bodily Harm', 2, 5, 'Yes', 'Yes', 'Yes', 26, 10, 2009, 'When his old pal, Terry Marsh, comes to town, Cal is thrilled to see him, but it turns out Terry is in a bit of a bind and coerces Cal into helping him. Meanwhile, the rest of the team meets with some students from a prep school to determine if any of them are responsible for a threatening tape that was sent to the headmaster, and are surprised when they learn the reason behind the tape.', 'Y', 'N', 8.3),
	('Lie To Me', 'Lack Of Candor', 2, 6, 'Yes', 'Yes', 'Yes', 9, 11, 2009, 'After a federal witness in protective custody is assassinated, the US attorney calls on Ben, who worked undercover on the case, to testify instead. However, Elliott Green, the Wall Street mobster whose trial starts in four days, knows a secret about Ben. Knowing he\'ll be discredited on the stand, and then arrested, Ben refuses to testify; without his testimony, Green will walk. Cal. Gillian, Ben, and the US Attorney work to unravel the mess and fix it, but the clock is ticking. Meanwhile, Ria and Eli work on figuring out who leaked the whereabouts of the original witness and got him killed.', 'Y', 'N', 7.9),
	('Lie To Me', 'Black Friday', 2, 7, 'Yes', 'Yes', 'Yes', 16, 11, 2009, 'Cal and Gillian help a teenager who believes he was abducted as a baby. Meanwhile, a stampede of holiday shoppers, resulting in two deaths and multiple injuries, triggers a $20 million lawsuit. The store owner hires Eli and Ria to get to the bottom of the cause and agree to pay them 10% of whatever amount they save him, meaning the Lightman Group could receive $2 million if they find the store owner wasn\'t at fault and therefore, not liable.', 'Y', 'N', 7.9),
	('Lie To Me', 'Secret Santa', 2, 8, 'Yes', 'Yes', 'Yes', 23, 11, 2009, 'Just before Christmas, Cal is sent to Afghanistan to help find two American marines captured by the Taliban. The man he\'s supposed to get information from is a prisoner, an American traitor who switched sides. During his conversations with the man, Cal finds there\'s a lot more to his story.', 'Y', 'N', 7.9),
	('Lie To Me', 'Fold Equity', 2, 9, 'Yes', 'Yes', 'Yes', 30, 11, 2009, 'When an unknown underdog manages to earn a spot at the table in the World Series of Poker, he becomes the tournament darling, but when he disappears without a trace, the casino owner hires the Lightman Group. Despite his \'banned-for-life\' status, Cal, Gillian, and Ben head to Vegas to face off with the world\'s best liars and Cal\'s efforts are rewarded with a very special bonus. Meanwhile, Ria analyzes the expressions of the woman Eli is dating to determine if she\'s \'into him\' and the two share a very uncomfortable \'moment\'.', 'Y', 'N', 7.9),
	('Lie To Me', 'Tractor Man', 2, 10, 'Yes', 'Yes', 'Yes', 14, 12, 2009, 'A farmer, angry that his farm is in foreclosure, protests by parking his tractor, packed with explosives, right in front of the US Treasury building. Meanwhile, a group of third-graders who were brought in to find out who stole the class turtle, aren\'t allowed to leave until the danger has passed, and Eli is delegated to keep them entertained.', 'Y', 'N', 8.1),
	('Lie To Me', 'Beat The Devil', 2, 11, 'Yes', 'Yes', 'Yes', 7, 6, 2010, 'While giving a talk to some college students, Cal matches wits with a dangerous sociopath who always seems to be one step ahead of him. Meanwhile, Eli and Ria get the run-around from the government when they look into a UFO sighting.', 'Y', 'N', 8.8),
	('Lie To Me', 'Sweet Sixteen', 2, 12, 'Yes', 'Yes', 'Yes', 14, 6, 2010, 'Years earlier, Cal worked on a botched CIA case that resulted in the death of the wife and young daughter of an Irish terrorist named Doyle. The case was covered up but now Doyle was back in town, seeking answers and revenge. Gillian, who didn\'t know Cal at the time, was also working for the government. As a therapist, she was instructed to interview Cal but she didn\'t know there was an ulterior motive.', 'Y', 'N', 8),
	('Lie To Me', 'The Whole Truth', 2, 13, 'Yes', 'Yes', 'Yes', 21, 6, 2010, 'Cal is hired by the DA to be an expert witness at the trial of a beautiful, young woman charged with murdering her high-powered, and much older, billionaire husband... and Zoe is representing her. Meanwhile,Ria lets Eli in on a little secret.', 'Y', 'N', 8.3),
	('Lie To Me', 'React To Contact', 2, 14, 'Yes', 'Yes', 'Yes', 28, 6, 2010, 'Cal uses virtual reality and other unconventional therapy to help a war veteran get to the root of the cause for the severe PTSD he\'s been plagued with since returning home from the Middle East.', 'Y', 'N', 7.7),
	('Lie To Me', 'Teacher And Pupils', 2, 15, 'Yes', 'Yes', 'Yes', 12, 7, 2010, 'After being shot and left for dead, a police officer spends the last few hours of his life paralyzed, unable to move or speak, before finally succumbing to his injuries. Hoping to get some shred of information that may lead them to the people responsible, the FBI brings in Cal to see if there\'s any possible way to read a person who can\'t even move his eyes.', 'Y', 'N', 8.4),
	('Lie To Me', 'Delinquent', 2, 16, 'Yes', 'Yes', 'Yes', 19, 7, 2010, 'Ria hasn\'t seen or heard from her little sister, Ava, since she was sent to a juvenile detention center, so when she receives a message from Ava, desperately pleading for help, Ria, Cal, and Gillian run to the rescue. A teenager named Marly, Ava\'s best friend, went missing the night before and now she\'s dead, and her murder is somehow connected to the theft of a fancy egg.', 'Y', 'N', 7.9),
	('Lie To Me', 'Bullet Bump', 2, 17, 'Yes', 'Yes', 'Yes', 26, 7, 2010, 'At a ground-breaking ceremony for a new community center, an assassin\'s bullet misses the governor, but kills a young woman on his staff instead. When the governor jumps nine points in the polls, Cal immadiately suspects him or someone high up on his staff, for what he calls a \'bullet bump\'.', 'Y', 'N', 7.9),
	('Lie To Me', 'Headlock', 2, 18, 'Yes', 'Yes', 'Yes', 2, 8, 2010, 'Cal involves his team in a cover-up when a fighter from an underground extreme boxing fight club for illegal aliens is murdered.', 'Y', 'N', 7.6),
	('Lie To Me', 'Pied Piper', 2, 19, 'Yes', 'Yes', 'Yes', 16, 8, 2010, 'Cal and Zoe attend the execution of a man they helped put on death row, and moments before they throw the switch, he claims to be innocent... and Cal believes him. Racked with guilt that he might have sent an innocent man to his death, Cal defies orders from the FBI to stay out of it and goes in search of answers.', 'Y', 'N', 8.1),
	('Lie To Me', 'Exposed', 2, 20, 'Yes', 'Yes', 'Yes', 23, 8, 2010, 'When Gillian\'s boyfriend, Dave Burns, gets abducted, Cal attempts to track him down with the help of Burns\' mysterious ex-partner.', 'Y', 'N', 7.7),
	('Lie To Me', 'Darkness And Light', 2, 21, 'Yes', 'Yes', 'Yes', 30, 8, 2010, 'A distraught father comes to Cal for help to find his 18 year old daughter who disappeared and then turned up in the porn business. In their search for the girl, Cal and Gillian uncover criminal activity that puts the lives of the actors in the industry in danger. Cal pits Eli and Ria against each other as they vie for the same promotion and the two share another \'close encounter\'.', 'Y', 'N', 8.2),
	('Lie To Me', 'Black And White', 2, 22, 'Yes', 'Yes', 'Yes', 13, 9, 2010, 'After Cal\'s journalist friend, Julie, is murdered over an investigative piece she\'s writing on political corruption in Baltimore, Cal decides his team should continue her work and finish the story.', 'Y', 'N', 7.8),
	('Lie To Me', 'In The Red', 3, 1, 'Yes', 'Yes', 'Yes', 4, 10, 2010, 'Cal tries to thwart a bank robbery from the inside by forcing his way into the gang, while trying to talk one of the robbers out of getting revenge for the bank foreclosing on his home.', 'Y', 'N', 7.6),
	('Lie To Me', 'The Royal We', 3, 2, 'Yes', 'Yes', 'Yes', 11, 10, 2010, 'Cal dives head first into the world of beauty pageant teens and their obsessive parents who won\'t stop pushing them. He strives to mend a broken relationship between a dysfunctional mother and daughter while at the same time, prove a man has been unjustly accused.', 'Y', 'N', 7.6),
	('Lie To Me', 'Dirty Loyal', 3, 3, 'Yes', 'Yes', 'Yes', 18, 10, 2010, 'Cal has a personal interest in an Internal Affairs investigation of a police officer, accused of murdering a gang banger.', 'Y', 'N', 7.5),
	('Lie To Me', 'Double Blind', 3, 4, 'Yes', 'Yes', 'Yes', 25, 10, 2010, 'Ria blames herself when two museum security guards, that she vetted and approved, try to steal a valuable artifact and get shot by another guard. The third guard, a retired cop who\'d never shot anyone before, is racked with guilt when both men die, one instantly, and the other a couple of hours later. Cal becomes involved in a game of cat-and-mouse with a beautiful woman and the man who\'s stalking her.', 'Y', 'N', 7.7),
	('Lie To Me', 'The Canary\'s Song', 3, 5, 'Yes', 'Yes', 'Yes', 8, 11, 2010, 'Cal puts his life on the line when he goes below to investigate an explosion that killed six coal miners. Gillian does a final favor for the FBI in exchange for getting both Cal and the Lightman Group out from under their thumb, once and for all.', 'Y', 'N', 7.4),
	('Lie To Me', 'Beyond Belief', 3, 6, 'Yes', 'Yes', 'Yes', 15, 11, 2010, 'Cal goes head-to-head with a cult-like self-help guru, as he tries to free a wealthy woman from his control. As the investigation progresses, Cal starts playing hard-ball when things get very personal and he feels like he and Emily are being threatened.', 'Y', 'N', 7.5),
	('Lie To Me', 'Veronica', 3, 7, 'Yes', 'Yes', 'Yes', 22, 11, 2010, 'Emily is paying more attention to her texting than her driving, and hits a pedestrian. Luckily the woman isn\'t hurt, but she seems confused and nervous so Emily calls her dad. The woman has early-onset Alzheimer\'s and claims a man named Charlie killed her sister, Rose, and now he\'s after her. Cal decides to help her piece her fragmented memories together to see if there\'s any truth to her claim.', 'Y', 'N', 7.5),
	('Lie To Me', 'Smoked', 3, 8, 'Yes', 'Yes', 'Yes', 29, 11, 2010, 'Cal assists Det. Wallowski find who murdered the daughter of a terminally ill friend of hers before the man dies. Meanwhile, Torres is mugged and goes looking for the guy who did it.', 'Y', 'N', 7.5),
	('Lie To Me', 'Funhouse', 3, 9, 'Yes', 'Yes', 'Yes', 10, 1, 2011, 'Emily wants Cal to help her worried friend whose dad has been in a psychiatric facility for 4 years. Cal is immediately suspicious of the facility and puts his own sanity on the line when he gets himself committed to work the case from the inside.', 'Y', 'N', 8.2),
	('Lie To Me', 'Rebound', 3, 10, 'Yes', 'Yes', 'Yes', 10, 1, 2011, 'A wealthy woman asks Cal to check out her new boyfriend when her son discovers a briefcase filled with cash and Cal uncovers a lot more than he expected to.', 'Y', 'N', 8),
	('Lie To Me', 'Saved', 3, 11, 'Yes', 'Yes', 'Yes', 17, 1, 2011, 'Cal investigates an deadly traffic accident caused by three high school students on a joy ride, and stumbles onto something much bigger.', 'Y', 'N', 7.6),
	('Lie To Me', 'Gone', 3, 12, 'Yes', 'Yes', 'Yes', 24, 1, 2011, 'After a baby goes missing, the investigation zigzags all over the place until Cal and his team open a massive can of worms, revealing a family completely crippled by their dysfunction.', 'Y', 'N', 7.7),
	('Lie To Me', 'Killer App', 3, 13, 'Yes', 'Yes', 'Yes', 31, 1, 2011, 'In the series Finale, Cal takes a wicked pleasure in wiping the arrogant smirk off the face of a computer entrepreneur who Cal believes murdered one of his partners and framed his other partner in order to gain full ownership of a successful social networking site the three created together.', 'Y', 'N', 8.2),
	('Maigret', 'Maigret Sets A Trap', 1, 1, 'Yes', 'Yes', 'Yes', 23, 8, 2016, 'Four women have been murdered in Montmartre, with no apparent connection between the victims. Chief Inspector Maigret comes under huge pressure from the public and his superiors to apprehend the killer before he can strike again.', 'Y', 'N', 7),
	('Maigret', 'Maigret\'s Dead Man', 1, 2, 'Yes', 'Yes', 'Yes', 25, 12, 2016, 'A series of vicious, murderous attacks on three wealthy farms in Picardy hit the national headlines and the elite Brigade Criminelle at the Quay Des Orfevres is called upon to lend its expertise in tracking down the brutal gang responsible for the slaughter. However, Maigret is resolute in investigating the murder of an obscure anonymous Parisian.', 'Y', 'N', 7.4),
	('Maigret', 'Night At The Crossroads', 2, 1, 'Yes', 'Yes', 'No', 16, 4, 2017, 'Georges Simenon\'s Night At The Crossroads is a complex tale of murder, deceit and greed in an isolated country community. Maigret has been interrogating a mysterious Dane, Carl Andersen, for hours without a confession. Why was the body of a diamond merchant found in his car at his isolated mansion? He\'s either innocent or a very good liar. What does his beautiful but vulnerable sister know? And what compels everyone at the Three Widows Crossroads to be so secretive? Maigret sets out to find his killer. ', 'N', 'N', 7.7),
	('Marvels Agent Carter', 'Now Is Not The End', 1, 1, 'Yes', 'Yes', 'Yes', 6, 1, 2015, 'Peggy is contacted by old acquaintance Howard Stark when he is framed for unleashing his deadliest weapons and can trust no one else. To help Peggy clear Stark\'s name, he insists his butler, Edwin Jarvis, be at her beck and call--whether she likes it or not. But the risk is great: If caught, Agent Carter could be targeted as a traitor and spend the rest of her days in prison...or worse.', 'Y', 'N', 8.1),
	('Marvels Agent Carter', 'Bridge And Tunnel', 1, 2, 'Yes', 'Yes', 'Yes', 6, 1, 2015, 'Howard Stark\'s deadliest weapon has fallen into enemy hands, and only Agent Carter can recover it. But can she do so before her undercover mission is discovered by SSR Chief Dooley and Agent Thompson?', 'Y', 'N', 8.2),
	('Marvels Agent Carter', 'Time And Tide', 1, 3, 'Yes', 'Yes', 'Yes', 13, 1, 2015, 'As Agent Carter closes in on Howard Stark\'s stolen technology, Peggy\'s secret mission could unravel when the SSR arrests Jarvis and a secret is revealed.', 'Y', 'N', 8.1),
	('Marvels Agent Carter', 'The Blitzkrieg Button', 1, 4, 'Yes', 'Yes', 'Yes', 27, 1, 2015, 'Peggy may be in more trouble than usual when fugitive Howard Stark suddenly returns for mysterious reasons. And Chief Dooley chases a new clue all the way to Europe that threatens to destroy Peggy\'s future at the SSR.', 'Y', 'N', 7.9),
	('Marvels Agent Carter', 'The Iron Ceiling', 1, 5, 'Yes', 'Yes', 'Yes', 3, 2, 2015, 'Peggy is finally trusted with a mission and calls upon her trusted Howling Commandos squad for backup. But her cover could be at risk when SSR Chief Dooley also sends Agent Thompson with her.', 'Y', 'N', 8.7),
	('Marvels Agent Carter', 'A Sin To Err', 1, 6, 'Yes', 'Yes', 'Yes', 10, 2, 2015, 'Peggy discovers the shocking truth about Leviathan but doesn\'t realize that her true enemies are even closer than she imagined. Meanwhile, Souza is close to confirming the truth about Peggy and may just put her in the crosshairs of the SSR.', 'Y', 'N', 8.6),
	('Marvels Agent Carter', 'SNAFU', 1, 7, 'Yes', 'Yes', 'Yes', 17, 2, 2015, 'Peggy is cornered and more vulnerable than ever as Leviathan makes their move against her. As the SSR zeroes in on Howard Stark, they may pay the ultimate price as they find their true enemy is closer than they realized.', 'Y', 'N', 8.8),
	('Marvels Agent Carter', 'Valediction', 1, 8, 'Yes', 'Yes', 'Yes', 24, 2, 2015, 'Peggy faces the full fury of Leviathan, as Howard Stark makes his return.', 'Y', 'N', 8.7),
	('Marvels Agent Carter', 'The Lady In The Lake', 2, 1, 'Yes', 'Yes', 'Yes', 19, 1, 2016, 'Peggy moves to the City of Angels to help Chief Daniel Sousa at the West Coast Strategic Scientific Reserve (SSR) investigate a bizarre homicide involving an alleged killer and Isodyne Energy, and reunites with some familiar faces.', 'Y', 'N', 8.4),
	('Marvels Agent Carter', 'A View In The Dark', 2, 2, 'Yes', 'Yes', 'Yes', 19, 1, 2016, 'Peggy discovers her murder investigation has huge ramifications that can destroy her career, as well as everyone near and dear to her.', 'Y', 'N', 8.3),
	('Marvels Agent Carter', 'Better Angels', 2, 3, 'Yes', 'Yes', 'Yes', 26, 1, 2016, 'Peggy\'s search for the truth about Zero Matter puts her on a collision course with her superiors as Howard Stark barnstorms in.', 'Y', 'N', 8.1),
	('Marvels Agent Carter', 'Smoke And Mirrors', 2, 4, 'Yes', 'Yes', 'Yes', 2, 2, 2016, 'Agent Carter and the SSR learn there\'s more than just a pretty face behind Hollywood star Whitney Frost, Peggy\'s most dangerous foe yet.', 'Y', 'N', 8),
	('Marvels Agent Carter', 'The Atomic Job', 2, 5, 'Yes', 'Yes', 'Yes', 9, 2, 2016, 'As Jarvis\' precision and quick-thinking skills are put to the ultimate test, Peggy must find a way to stop an atomic explosion that threatens to destroy all of California.', 'Y', 'N', 8),
	('Marvels Agent Carter', 'Life Of The Party', 2, 6, 'Yes', 'Yes', 'Yes', 16, 2, 2016, 'When Peggy realizes she needs help saving Wilkes, she turns to an unexpected adversary for help while Whitney tries to control the deadly Zero Matter.', 'Y', 'N', 8.3),
	('Marvels Agent Carter', 'Monsters', 2, 7, 'Yes', 'Yes', 'Yes', 16, 2, 2016, 'As Peggy plots a rescue mission, Whitney hunts for even more dark power; and Jarvis learns he should not make promises he cannot keep.', 'Y', 'N', 8.6),
	('Marvels Agent Carter', 'The Edge Of Mystery', 2, 8, 'Yes', 'Yes', 'Yes', 23, 2, 2016, 'Peggy and Sousa propose a trade with Whitney Frost, while the SSR gets help from Howard Stark that may be the key to eliminating Zero Matter.', 'Y', 'N', 8.3),
	('Marvels Agent Carter', 'A Little Song And Dance', 2, 9, 'Yes', 'Yes', 'Yes', 23, 2, 2016, 'Peggy desperately tries to save Dr. Wilkes with a dangerous plan to stop Whitney Frost. But Thompson makes a surprising move that could destroy them all.', 'Y', 'N', 8.5),
	('Marvels Agent Carter', 'Hollywood Ending', 2, 10, 'Yes', 'Yes', 'Yes', 1, 3, 2016, 'Peggy needs Howard Stark to eliminate Zero Matter as they are faced with a mission none of them could come back from.', 'Y', 'N', 8.3),
	('Marvels Agents Of SHIELD', 'Pilot', 1, 1, 'Yes', 'Yes', 'Yes', 24, 9, 2013, 'In the aftermath of The Avengers\' battle in New York City, the world attempts to come to grips with the presence of superheroes, gods, and aliens in their midst. Agent Coulson is resurrected under mysterious circumstances and forms an elite team of agents from S.H.I.E.L.D. to keep track of a secret organization known as The Rising Tide. Meanwhile, they must deal with other menaces, such as a man who suddenly finds himself with vast uncontrollable power.', 'Y', 'N', 7.6),
	('Marvels Agents Of SHIELD', '0-8-4', 1, 2, 'Yes', 'Yes', 'Yes', 1, 10, 2013, 'Coulson and his S.H.I.E.L.D. agents travel to Peru to investigate an object of unknown origin, codenamed 0-8-4. But things become complicated when he runs into old flame Comandante Camilla Reyes.', 'Y', 'N', 7.2),
	('Marvels Agents Of SHIELD', 'The Asset', 1, 3, 'Yes', 'Yes', 'Yes', 8, 10, 2013, 'When brilliant scientist Dr. Franklin Hall is kidnapped, Agent Coulson and his S.H.I.E.L.D. agents must race against the clock to locate him. Skye is their only way in, pushing the team to their limits.', 'Y', 'N', 7.5),
	('Marvels Agents Of SHIELD', 'Eye Spy', 1, 4, 'Yes', 'Yes', 'Yes', 15, 10, 2013, 'Coulson and his team try to track down a mysterious woman who has single-handedly committed numerous high-stakes heists. But when the woman\'s identity is revealed, a troubling secret stands to ruin Coulson.', 'Y', 'N', 7.6),
	('Marvels Agents Of SHIELD', 'Girl In The Flower Dress', 1, 5, 'Yes', 'Yes', 'Yes', 22, 10, 2013, 'An elusive girl in a flower dress may hold the key to the mystery that brings Coulson and his team to Asia to rescue a young man with an unusual and dangerous power and Skye has a secret that jeopardizes her relationship with the team right when they need her most.', 'Y', 'N', 7.6),
	('Marvels Agents Of SHIELD', 'F.Z.Z.T.', 1, 6, 'Yes', 'Yes', 'Yes', 5, 11, 2013, 'When mysterious floating bodies turn up, Coulson and his team must hunt down an elusive killer before they strike again, everyone at risk.', 'Y', 'N', 8.1);
INSERT INTO `t1` (`serial`, `name`, `season`, `episode`, `seena`, `seens`, `sub`, `day`, `month`, `year`, `summary`, `pics`, `ppt`, `rating`) VALUES
	('Marvels Agents Of SHIELD', 'The Hub', 1, 7, 'Yes', 'Yes', 'Yes', 12, 11, 2013, 'Dangerous secrets are being kept from Coulson\'s team, and he works the system to save Ward and Fitz when they are sent on a Level 8 classified missionthat may end in tragedy. ', 'Y', 'N', 7.7),
	('Marvels Agents Of SHIELD', 'The Well', 1, 8, 'Yes', 'Yes', 'Yes', 19, 11, 2013, 'In the aftermath of the events chronicled in the film \'Thor: The Dark World\', Coulson and his team pick up the pieces - one of which threatens to destroy them.', 'Y', 'N', 7.9),
	('Marvels Agents Of SHIELD', 'Repairs', 1, 9, 'Yes', 'Yes', 'Yes', 26, 11, 2013, 'Coulson and his team are haunted by a mysterious force that threatens to destroy them all, and only a secret from May\'s past can save them.', 'Y', 'N', 7.4),
	('Marvels Agents Of SHIELD', 'The Bridge', 1, 10, 'Yes', 'Yes', 'Yes', 10, 12, 2013, 'In a shocking cliffhanger episode, Coulson takes the war back to Centipede, and this time he brings in Mike Peterson for some super-soldier support. As they get closer to the truth, startling secrets are revealed and an unexpected twist threatens the team.', 'Y', 'N', 8.1),
	('Marvels Agents Of SHIELD', 'The Magical Place', 1, 11, 'Yes', 'Yes', 'Yes', 7, 1, 2014, 'Coulsen discovers important information about his mysterious death but it may come at a cost to the team.', 'Y', 'N', 8.2),
	('Marvels Agents Of SHIELD', 'Seeds', 1, 12, 'Yes', 'Yes', 'Yes', 14, 1, 2014, 'Coulsen and May discover startling information about Skye\'s past, while the team is swept into a storm at S.H.I.E.L.D. Academy.', 'Y', 'N', 8),
	('Marvels Agents Of SHIELD', 'T.R.A.C.K.S.', 1, 13, 'Yes', 'Yes', 'Yes', 4, 2, 2014, 'Hot on the trail of the Clairvoyant, Coulson and his team board a mystery train that seems to be headed for certain death.', 'Y', 'N', 8.7),
	('Marvels Agents Of SHIELD', 'T.A.H.I.T.I.', 1, 14, 'Yes', 'Yes', 'Yes', 4, 3, 2014, 'Coulson goes on the attack to save Skye--enlisting the aid of Ward\'s former S.O. John Garrett and uncovers shocking truths about his own life and S.H.I.E.L.D.', 'Y', 'N', 8.5),
	('Marvels Agents Of SHIELD', 'Yes Men', 1, 15, 'Yes', 'Yes', 'Yes', 11, 3, 2014, 'Lady Sif arrives on a hunting mission sent by Odin to find her arch-enemy Lorelei and bring her back to Asgard. It throws the team for a loop when they find themselves in a fight right alongside this powerful powerful Asgardian warrior woman.', 'Y', 'N', 8.2),
	('Marvels Agents Of SHIELD', 'End Of The Beginning', 1, 16, 'Yes', 'Yes', 'Yes', 1, 4, 2014, 'Agents Garrett and Triplett are back to help Coulson\'s team track down S.H.I.E.L.D.\'s nefarious enemy - the Clairvoyant. But will Deathlok destroy them all to protect his master\'s identity?', 'Y', 'N', 8.7),
	('Marvels Agents Of SHIELD', 'Turn, Turn, Turn', 1, 17, 'Yes', 'Yes', 'Yes', 8, 4, 2014, 'Coulson and his team find themselves without anyone they can trust, only to discover that they are trapped with a traitor in their midst.', 'Y', 'N', 9.3),
	('Marvels Agents Of SHIELD', 'Providence', 1, 18, 'Yes', 'Yes', 'Yes', 15, 4, 2014, 'With Colonel Glenn Talbot now on their trail, Coulson and his team seek refuge in the last place anyone would look, where they begin to uncover S.H.I.E.L.D.\'s most dangerous secrets--secrets that could destroy them all.', 'Y', 'N', 8.4),
	('Marvels Agents Of SHIELD', 'The Only Light In The Darkness', 1, 19, 'Yes', 'Yes', 'Yes', 22, 4, 2014, 'With their WORLD turned upside down, Coulson races to save the life of his one true love as the mystery of \'The Cellist\', which began in Marvel\'s The Avengers, is finally revealed on Marvel\'s Agents of S.H.I.E.L.D', 'Y', 'N', 8.4),
	('Marvels Agents Of SHIELD', 'Nothing Personal', 1, 20, 'Yes', 'Yes', 'Yes', 29, 4, 2014, 'Just when there\'s no one left to trust, Agent Maria Hill returns to team up with Coulson as S.H.I.E.L.D. is being destroyed around them.', 'Y', 'N', 8.8),
	('Marvels Agents Of SHIELD', 'Ragtag', 1, 21, 'Yes', 'Yes', 'Yes', 6, 5, 2014, 'Ward\'s betrayal and Hydra\'s shocking secrets are revealed as Coulson\'s team goes undercover on a mission that leaves no one unscathed.', 'Y', 'N', 8.5),
	('Marvels Agents Of SHIELD', 'Beginning Of The End', 1, 22, 'Yes', 'Yes', 'Yes', 13, 5, 2014, 'Dark secrets are revealed as Coulson and his team put everything on the line to stop Garrett and the forces of Hydra.', 'Y', 'N', 9.1),
	('Marvels Agents Of SHIELD', 'Shadow', 2, 1, 'Yes', 'Yes', 'Yes', 23, 9, 2014, 'Coulson and his team are now wanted fugitives with limited resources  but that\'s not stopping them from keeping the world safe from powerful and unseen threats everywhere. However, with new members they hardly know, will S.H.I.E.L.D. ever be trusted again?', 'Y', 'N', 8.4),
	('Marvels Agents Of SHIELD', 'Heavy Is The Head', 2, 2, 'Yes', 'Yes', 'Yes', 30, 9, 2014, 'Hunted and running out of solutions, Coulson puts his team right in the line of fire, with General Talbot, Hydra and Creel all on the attack. A mysterious Doctor harbors some dangerous secrets that could destroy one of our core team members.', 'Y', 'N', 8.2),
	('Marvels Agents Of SHIELD', 'Making Friends And Influencing People', 2, 3, 'Yes', 'Yes', 'Yes', 7, 10, 2014, 'Coulson and his team race against HYDRA to get to Donnie Gill  a dangerous gifted with the ability to freeze objects  while Simmons is caught in the crossfire.', 'Y', 'N', 8.2),
	('Marvels Agents Of SHIELD', 'Face My Enemy', 2, 4, 'Yes', 'Yes', 'Yes', 14, 10, 2014, 'While on a mission to learn more about the secrets of the mysterious writing, Coulson finds himself attacked by the only person he can trust: Agent Melinda May. The rest of the team is trapped in an explosive situation, and it\'s up to Fitz to save them.', 'Y', 'N', 8.3),
	('Marvels Agents Of SHIELD', 'A Hen In The Wolf House', 2, 5, 'Yes', 'Yes', 'Yes', 21, 10, 2014, 'Coulson\'s team is up against the beautiful and deadly Bobbi Morse  Security Chief for Hydra. Skye\'s father forces Raina to reunite him with his daughter at any cost.', 'Y', 'N', 8.8),
	('Marvels Agents Of SHIELD', 'A Fractured House', 2, 6, 'Yes', 'Yes', 'Yes', 28, 10, 2014, 'The world turns against S.H.I.E.L.D. when Hydra impersonates them to attack The United Nations, and an unexpected enemy leads the charge to bring about their downfall.', 'Y', 'N', 8.4),
	('Marvels Agents Of SHIELD', 'The Writing On The Wall', 2, 7, 'Yes', 'Yes', 'Yes', 11, 11, 2014, 'The team discovers murder victims with the alien glyphs on them that Coulson\'s been etching. All of Coulson\'s secrets and lies come to a head.', 'Y', 'N', 8.6),
	('Marvels Agents Of SHIELD', 'The Things We Bury', 2, 8, 'Yes', 'Yes', 'Yes', 18, 11, 2014, 'Coulson and team find themselves in an epic face-off against Hydra to uncover an ancient secret, while Ward kidnaps his brother, Senator Christian Ward, for a violent trip down memory lane.', 'Y', 'N', 8.7),
	('Marvels Agents Of SHIELD', '... Ye Who Enter Here', 2, 9, 'Yes', 'Yes', 'Yes', 2, 12, 2014, 'SHIELD discovers the ancient city before Hydra, but uncovering the secrets may require one of Coulsons team to make the ultimate sacrifice. Meanwhile, May and Skye race to get to Raina before Whitehall takes her.', 'Y', 'N', 8.6),
	('Marvels Agents Of SHIELD', 'What They Become', 2, 10, 'Yes', 'Yes', 'Yes', 9, 12, 2014, 'Coulson and Whitehall\'s forces meet in an explosive confrontation that dramatically alters everyone\'s fates. Meanwhile, Skye discovers shocking secrets about her past.', 'Y', 'N', 9.3),
	('Marvels Agents Of SHIELD', 'Aftershocks', 2, 11, 'Yes', 'Yes', 'Yes', 3, 3, 2015, 'Coulson\'s team must deal with the consequences of their war with Hydra as shocking revelations threaten to tear them apart, and Hydra makes a dangerous move that may involve a traitor in S.H.I.E.L.D.\'s midst.', 'Y', 'N', 8.6),
	('Marvels Agents Of SHIELD', 'Who You Really Are', 2, 12, 'Yes', 'Yes', 'Yes', 10, 3, 2015, 'Coulson and team come to the aid of a confused Lady Sif, who has lost her memory after fighting with a mysterious warrior whose true mission will send shockwaves through S.H.I.E.L.D. Meanwhile, Bobbi and Mack continue to hide their true mission from everyone close to them.', 'Y', 'N', 8.2),
	('Marvels Agents Of SHIELD', 'One Of Us', 2, 13, 'Yes', 'Yes', 'Yes', 17, 3, 2015, 'Cal seeks revenge on Coulson by assembling a team of Super Villains to destroy S.H.I.E.L.D. Meanwhile, May calls on renowned Dr. Andrew Garner, her charismatic ex-husband, with a crisis that threatens to tear the team apart.', 'Y', 'N', 8.1),
	('Marvels Agents Of SHIELD', 'Love In The Time Of Hydra', 2, 14, 'Yes', 'Yes', 'Yes', 24, 3, 2015, 'Coulson and his team are still reeling from a shocking revelation that leaves the team fractured as they must decide what to do with one of their own. Meanwhile, Bobbi and Mack reveal their true allegiance to Hunter, while elsewhere, Ward and Agent 33 embark on a personal mission.', 'Y', 'N', 7.9),
	('Marvels Agents Of SHIELD', 'One Door Closes', 2, 15, 'Yes', 'Yes', 'Yes', 31, 3, 2015, 'War comes to Coulsons doorstep in a way he never anticipated as shocking revelations are brought to light, and Skye struggles to control her new abilities but will soon make a decision that irrevocably changes her life.', 'Y', 'N', 8.8),
	('Marvels Agents Of SHIELD', 'Afterlife', 2, 16, 'Yes', 'Yes', 'Yes', 7, 4, 2015, 'As Robert Gonzalez makes his move, Coulson must do whatever it takes to protect the future of S.H.I.E.L.D.. Meanwhile Skyes journey to control her powers takes a surprising turn when she meets the enigmatic Inhuman named Lincoln.', 'Y', 'N', 8.4),
	('Marvels Agents Of SHIELD', 'Melinda', 2, 17, 'Yes', 'Yes', 'Yes', 14, 4, 2015, 'The story of Melinda Mays transformation into The Cavalry is revealed as she finds herself at a crossroads in the war between Coulson and Gonzales. As Skye learns more about her true heritage from Lincoln, the truth about the Inhumans will send her in a new direction.', 'Y', 'N', 8.5),
	('Marvels Agents Of SHIELD', 'The Frenemy Of My Enemy', 2, 18, 'Yes', 'Yes', 'Yes', 21, 4, 2015, 'A dangerous new alliance is formed as Coulson and Hunter turn to the last person anyone would expect  Grant Ward! As the war between S.H.I.E.L.D. factions continues, Skye and Lincoln will find themselves drawn into this conflict.', 'Y', 'N', 8.6),
	('Marvels Agents Of SHIELD', 'The Dirty Half Dozen', 2, 19, 'Yes', 'Yes', 'Yes', 28, 4, 2015, 'Gonzales and Coulson must find a way to put their differences aside and work together against Hydra, even if it means teaming up with someone they don\'t trust.', 'Y', 'N', 8.9),
	('Marvels Agents Of SHIELD', 'Scars', 2, 20, 'Yes', 'Yes', 'Yes', 5, 5, 2015, 'Skye is torn between her loyalty to S.H.I.E.L.D. and her connection to the Inhumans as tensions rise between the groups -- and Coulson reveals a secret hes been hiding from even those closest to him.', 'Y', 'N', 8.7),
	('Marvels Agents Of SHIELD', 'S.O.S. - 1', 2, 21, 'Yes', 'Yes', 'Yes', 12, 5, 2015, 'S.H.I.E.L.D. puts everything on the line to survive a war that blurs the line between friend and foe. Coulson and his team will be forced to make shocking sacrifices that will leave their relationships and their world changed forever.', 'Y', 'N', 9.2),
	('Marvels Agents Of SHIELD', 'S.O.S. - 2', 2, 22, 'Yes', 'Yes', 'Yes', 12, 5, 2015, 'S.H.I.E.L.D. puts everything on the line to survive a war that blurs the line between friend and foe. Coulson and his team will be forced to make shocking sacrifices that will leave their relationships and their world changed forever.', 'Y', 'N', 9.5),
	('Marvels Agents Of SHIELD', 'Laws Of Nature', 3, 1, 'Yes', 'Yes', 'No', 29, 9, 2015, 'When Coulson and the team discover a new Inhuman, S.H.I.E.L.D. comes face to face with another organization searching for powered people. And still reeling from Simmons\' dramatic disappearance, Fitz goes to extreme lengths to try to learn how to get her back.', 'Y', 'N', 8.9),
	('Marvels Agents Of SHIELD', 'Purpose In The Machine', 3, 2, 'Yes', 'Yes', 'No', 6, 10, 2015, 'Fitz and the team enlist the aid of an Asgardian to unlock the secrets of the ancient monolith that swallowed Simmons, and Agent May is at a crossroads in her personal and professional life.', 'Y', 'N', 8.8),
	('Marvels Agents Of SHIELD', 'A Wanted (Inhu)Man', 3, 3, 'Yes', 'Yes', 'No', 13, 10, 2015, 'Daisy, Mack and Coulson race to protect Lincoln as Rosalind\'s team hunts down the Inhuman in their quest for powered people. Meanwhile, Hunter proves that there is no line that he will not cross to exact his revenge against Ward and Hydra.', 'Y', 'N', 8.2),
	('Marvels Agents Of SHIELD', 'Devils You Know', 3, 4, 'Yes', 'Yes', 'No', 20, 10, 2015, 'Having reluctantly agreed to share information with Rosalind Price and the ATCU, Coulson and the team go in search for the Inhuman who is killing off other Inhumans, and May feels that Hunter\'s mission to take down Ward is getting too personal.', 'Y', 'N', 8.5),
	('Marvels Agents Of SHIELD', '4,722 Hours', 3, 5, 'Yes', 'Yes', 'No', 27, 10, 2015, 'After her dramatic rescue from another planet, Simmons is still reeling from her ordeal and reveals how she had to fight for her life in a harsh new world.', 'Y', 'N', 9.3),
	('Marvels Agents Of SHIELD', 'Among Us Hide...', 3, 6, 'Yes', 'Yes', 'No', 3, 11, 2015, 'The stakes get even higher as Hunter and May continue to go after Ward and Hydra, and Daisy and Coulson begin to suspect that the ATCU may be keeping a big secret from S.H.I.E.L.D.', 'Y', 'N', 8.5),
	('Marvels Agents Of SHIELD', 'Chaos Theory', 3, 7, 'Yes', 'Yes', 'No', 10, 11, 2015, 'As Daisy and the team fight to protect Inhumans, S.H.I.E.L.D. discovers the shocking truth about one of their biggest foes. Meanwhile, Fitz helps Simmons recover information that could lead them back through the portal.', 'Y', 'N', 8.6),
	('Marvels Agents Of SHIELD', 'Many Heads, One Tale', 3, 8, 'Yes', 'Yes', 'No', 17, 11, 2015, 'The S.H.I.E.L.D. team discovers dangerous truths about the ATCU, and Ward\'s plans to destroy S.H.I.E.L.D. takes a surprising twist.', 'Y', 'N', 9.1),
	('Marvels Agents Of SHIELD', 'Closure', 3, 9, 'Yes', 'Yes', 'No', 1, 12, 2015, 'Ward\'s campaign for revenge brings the S.H.I.E.L.D. team to their knees, and Coulson proves he will do anything to settle the score.', 'Y', 'N', 9.1),
	('Marvels Agents Of SHIELD', 'Maveth', 3, 10, 'Yes', 'Yes', 'No', 8, 12, 2015, 'S.H.I.E.L.D. and Hydra go head-to-head in a battle that will change Coulson\'s world forever. While Daisy and her team of Inhumans fight to keep Hydra at bay, Coulson and Fitz take the ultimate risk.', 'Y', 'N', 9.1),
	('Marvels Agents Of SHIELD', 'Bouncing Back', 3, 11, 'Yes', 'Yes', 'No', 8, 3, 2016, 'In the aftermath of his trip to Maveth, Coulson is more determined than ever to get to Gideon Malick and put an end to Hydra once and for all. Daisy and the team encounter more Inhumans who have powers like they\'ve never seen before, but will they be friends or enemies of S.H.I.E.L.D.?', 'Y', 'N', 8.3),
	('Marvels Agents Of SHIELD', 'The Inside Man', 3, 12, 'Yes', 'Yes', 'No', 15, 3, 2016, 'Coulson and General Talbot are forced to team up and attend a worldwide symposium on Inhumans, where they suspect Malick has an inside man. As the S.H.I.E.L.D. team gets closer to the truth, an unexpected traitor is revealed.', 'Y', 'N', 8.2),
	('Marvels Agents Of SHIELD', 'Parting Shot', 3, 13, 'Yes', 'Yes', 'No', 22, 3, 2016, 'Bobbi and Hunter become ensnared in an assassination plot after tracking Malick to Russia. As S.H.I.E.L.D. races to save the lives on the line, the team is changed forever', 'Y', 'N', 8.7),
	('Marvels Agents Of SHIELD', 'Watchdogs', 3, 14, 'Yes', 'Yes', 'No', 29, 3, 2016, 'Agent Mack and his brother step in when a radical group called the Watchdogs plans to eliminate the Inhumans. Simmons finds a powerful chemical compound.', 'Y', 'N', 7.8),
	('Marvels Agents Of SHIELD', 'Spacetime', 3, 15, 'Yes', 'Yes', 'No', 5, 4, 2016, 'The S.H.I.E.L.D. team tries to prove that fate is not fixed after Daisy is horrified by a glimpse of the future.', 'Y', 'N', 8.8),
	('Marvels Agents Of SHIELD', 'Paradise Lost', 3, 16, 'Yes', 'Yes', 'No', 12, 4, 2016, 'S.H.I.E.L.D. hunts for information on their dangerous new enemy, and a shameful secret from Malick\'s past is exposed, threatening to destroy his Hydra legacy.', 'Y', 'N', 8.3),
	('Marvels Agents Of SHIELD', 'The Team', 3, 17, 'Yes', 'Yes', 'No', 19, 4, 2016, 'Agent Daisy Johnson brings the Secret Warriors together for a mission that will affect them all. knowledge of Hive\'s powers has S.H.I.E.L.D. mistrusting everyone.', 'Y', 'N', 9.1),
	('Marvels Agents Of SHIELD', 'The Singularity', 3, 18, 'Yes', 'Yes', 'No', 26, 4, 2016, 'The team reels from their losses as Hive continues to draw Inhumans to his side. Agents Fitz and Simmons get a lead that could stop the maniacal Inhuman forever.', 'Y', 'N', 8.4),
	('Marvels Agents Of SHIELD', 'Failed Experiments', 3, 19, 'Yes', 'Yes', 'No', 3, 5, 2016, 'Coulson and his team race to combat Hive\'s control over the Inhumans, as their enemy\'s deadly plan for the human race is revealed.', 'Y', 'N', 8.4),
	('Marvels Agents Of SHIELD', 'Emancipation', 3, 20, 'Yes', 'Yes', 'No', 10, 5, 2016, 'Daisys prophecy ticks closer towards a major loss, as the aftermath of the events of \'Marvels Captain America: Civil War\' force S.H.I.E.L.D. to register the Inhumans. But with the stakes higher than ever and Hive growing stronger, the team is tested in ways they could never anticipate. ', 'Y', 'N', 8.7),
	('Marvels Agents Of SHIELD', 'Absolution', 3, 21, 'Yes', 'Yes', 'No', 17, 5, 2016, 'It\'s a showdown a season in the making as S.H.I.E.L.D. takes on Hive. With Hive\'s master plan finally revealed, the team must spring into action. Who will live and who will die?', 'Y', 'N', 8.7),
	('Marvels Agents Of SHIELD', 'Ascension', 3, 22, 'Yes', 'Yes', 'No', 17, 5, 2016, 'It\'s a showdown a season in the making as S.H.I.E.L.D. takes on Hive. With Hive\'s master plan finally revealed, the team must spring into action. Who will live and who will die?', 'Y', 'N', 9.1),
	('Marvels Agents Of SHIELD', 'The Ghost', 4, 1, 'No', 'No', 'No', 20, 9, 2016, 'In light of the Sokovia Accords, and with Hydra obliterated, S.H.I.E.L.D. has been legitimatized again and no longer needs to operate in the shadows. Since the world presumes that Coulson is dead, the organization needed a new Director to be the face of the organization. Coulson finds himself back in the role as an agent and teamed with Mack, and together they are tasked with tracking down and confirming the presence of Enhanced people, aka Inhumans. Agent May is tasked with training specialist strike teams, and Fitz and Simmons have taken a big step forward in their relationship.', 'N', 'N', 8.5),
	('Marvels Agents Of SHIELD', 'Meet The New Boss', 4, 2, 'No', 'No', 'No', 27, 9, 2016, 'Following Coulson\'s stepping down as Director, Jeffrey Mace is made the new Director of S.H.I.E.L.D. and its public face. Daisy meets with Robbie at his place of work, saying she knows about his history but is surprised to find he isn\'t Inhuman like her. May\'s exposure from the specter last episode gets out of hand where Mace, revealing he\'s a super strong Inhuman, knocks her out and sends her to an undisclosed location. Mack & Fitz investigate the specter and encounter Ghost Rider. The specter who infected May releases her compatriots who were in similar containers for years due to using the \'Darkhold\'.', 'N', 'N', 8.3),
	('Marvels Agents Of SHIELD', 'Uprising', 4, 3, 'No', 'No', 'No', 11, 10, 2016, 'Coulson, Mack and Fitz try to locate and neutralize a rogue group looking to stop Inhuman Registration worldwide. Simmons and Dr. Radcliffe have only a short time to save May before she succumbs to her illness.', 'N', 'N', 8.5),
	('Marvels Agents Of SHIELD', 'Let Me Stand Next To Your Fire', 4, 4, 'No', 'No', 'No', 18, 10, 2016, 'As Ghost Riders quest for vengeance brings him into an explosive confrontation with S.H.I.E.L.D.. Coulson and Mack must rely on an unlikely ally in their time of desperate need. Daisy reunites with a familiar face to stop the Watchdogs.', 'N', 'N', 8.7),
	('Marvels Agents Of SHIELD', 'Lockup', 4, 5, 'No', 'No', 'No', 25, 10, 2016, 'As Robbie Reyes struggles to control The Ghost Rider, S.H.I.E.L.D. infiltrates a high-security prison to unravel the secrets that haunt them all.', 'N', 'N', 8.5),
	('Marvels Agents Of SHIELD', 'The Good Samaritan', 4, 6, 'No', 'No', 'No', 1, 11, 2016, 'The shocking origin story of Robbie\'s transition into Ghost Rider is revealed as the lives of Coulson and the team hang in the balance.', 'N', 'N', 9),
	('Marvels Agents Of SHIELD', 'Deals With Our Devils', 4, 7, 'No', 'No', 'No', 29, 11, 2016, 'After losing half their team, the remaining members look for answers as time begins to run out for Ghost Rider.', 'N', 'N', 9),
	('Marvels Agents Of SHIELD', 'The Laws Of Inferno Dynamics', 4, 8, 'No', 'No', 'No', 6, 12, 2016, 'S.H.I.E.L.D. and Ghost Rider find themselves unlikely allies when the lives of all of Los Angeles hang in the balance.', 'N', 'N', 8.9),
	('Marvels Agents Of SHIELD', 'Broken Promises', 4, 9, 'No', 'No', 'No', 10, 1, 2017, 'Coulson is unaware of a dark secret May is hiding, even as the two grow closer. Aida is determined to find the Darkhold. ', 'N', 'N', 8.6),
	('Marvels Agents Of SHIELD', 'The Patriot', 4, 10, 'No', 'No', 'No', 17, 1, 2017, 'Coulson and Mack discover a shocking secret about Mace, which leaves all of S.H.I.E.L.D. in a dangerous position.', 'N', 'N', 8.4),
	('Marvels Agents Of SHIELD', 'Wakeup', 4, 11, 'No', 'No', 'No', 24, 1, 2017, 'May races to find the truth about what happened to her, while Aidas next move could mean the death of them all.', 'N', 'N', 8.7),
	('Marvels Agents Of SHIELD', 'Hot Potato Soup', 4, 12, 'No', 'No', 'No', 31, 1, 2017, 'Agents Sam and Billy Koenig are hunted down to get at the Darkhold book, and only Coulson and the team can save them before the clock ticks out.', 'N', 'N', 8.4),
