	('Modern Family', 'Three Dinners', 5, 13, 'Yes', 'Yes', 'Yes', 29, 1, 2014, 'Phil and Claire take Haley out to dinner to discuss her future, but Haley manages to turn the tables. Elsewhere, Jays friend Shorty and wife Darlene are back visiting, and they have some news that doesnt sit well with Jay. And, Mitch and Cam decide to have a nice, romantic dinner date where they dont talk about the wedding or about Lily, which then leads to a lot of awkward silences.', 'Y', 'N', 8.2),
	('Modern Family', 'iSpy', 5, 14, 'Yes', 'Yes', 'Yes', 5, 2, 2014, 'Claire and Phil decide to spy on Luke and Manny as theyre hanging out with one of their more questionable friends. Meanwhile, Gloria is furious with Jay because she thinks he had a dream about another woman, but Jay misinterprets her anger for another offense he committed. And, Cam secretly uses Mitch as a scapegoat to get out of attending a party, while Haley tries to keep her photography exhibit a secret from her family.', 'Y', 'N', 8),
	('Modern Family', 'The Feud', 5, 15, 'Yes', 'Yes', 'Yes', 26, 2, 2014, 'Phil is upset to have lost his elected office of social chair to his nemesis Gil Thorpe, and when he finds out Luke is competing against Gil\'s kid in a wrestling match, it becomes his own personal battle. Claire is nervous for a big client meeting but things get extra hairy when Mitch and Cam ask her to pick up Lily from school and conveniently leave out the fact that her class just had a lice scare. Elsewhere, Gloria chaperones Manny\'s school field trip to the museum.', 'Y', 'N', 7.7),
	('Modern Family', 'Spring-A-Ding-Fling', 5, 16, 'Yes', 'Yes', 'Yes', 5, 3, 2014, 'Cameron is in charge of the schools big spring dance, but when a popular teacher returns from sabbatical, a bit of not-so-friendly competition blooms. And with Claire on chaperone duty at the dance, Phil gets Haley to accompany him to his annual realtors banquet and is looking forward to impressing his little girl. Elsewhere, Mitch starts a new job and cant seem to get a good read on the new boss or the work environment. Jay and Gloria babysit Lily and an accident with Glorias purse ignites a case of whodunit and its Lilys word against baby Joes.', 'Y', 'N', 7.7),
	('Modern Family', 'Other People\'s Children', 5, 17, 'Yes', 'Yes', 'Yes', 12, 3, 2014, 'Its male-bonding day when Jay takes Luke into the garage to show him the way around tools and impart some manly wisdom, and Gloria goes with Claire and Lily to shop for Lilys flower girl dress. Elsewhere, Mitch, Cam, Alex and Manny go for a cultured day at the museum but it eventually becomes survival of the smartest. And Phil enthusiastically offers to help Andy with his anniversary gift to his girlfriend, which is an elaborate video expression of his love.', 'Y', 'N', 8),
	('Modern Family', 'Las Vegas', 5, 18, 'Yes', 'Yes', 'Yes', 26, 3, 2014, 'The adults are Vegas-bound when Jay hooks them up with Excelsior Level hotel accommodations courtesy of one of his big clients, but after learning theres an even higher level, Jay becomes obsessed with upgrading. Meanwhile, everyones sneaking around when Claire secretly hits the tables to win back money she lost years ago, Phil goes underground auditioning for a secret society of magicians, Cam ducks out of a spa day with Mitch to join their friends bachelor party shenanigans, and Gloria is determined to hide a female version of dog butler Barkley from Jay.', 'Y', 'N', 9.2),
	('Modern Family', 'A Hard Jay\'s Night', 5, 19, 'Yes', 'Yes', 'Yes', 2, 4, 2014, 'Mitch struggles to hide his true feelings about the unflattering wedding topper Cam\'s father whittled out of soap for them, Phil tries to help Gloria sell her pre-Jay apartment but they get sidetracked at the neighborhood salon, and Claire and the kids head over to Jay\'s early to help him prep for the special night with the family he\'s hosting but they end up just butting heads.', 'Y', 'N', 7.8),
	('Modern Family', 'Australia', 5, 20, 'Yes', 'Yes', 'Yes', 23, 4, 2014, 'The entire family tags along as Phil fulfills his moms wish for him to return to his roots and visit the country where he was conceived, Australia. Unfortunately, Phils attempts to embrace his native land are met by a lot of rejection, while Jay and Claire let work eat into vacation time, and Mitch and Cam get reacquainted with an old friend they cant stand but is now a big-time celebrity in Australia.', 'Y', 'N', 7.9),
	('Modern Family', 'Sleeper', 5, 21, 'Yes', 'Yes', 'Yes', 30, 4, 2014, 'Phil fails at his one task to stay home and wait for the repairman, forcing him to tell an elaborate lie to hide the truth from Claire, but the stress is more than he can physically handle. Meanwhile, Gloria is obsessing over the family portrait she is responsible for organizing this year. Claire accuses Cam of being too snobby to use her girls hand-me-downs and Jay secretly enters Stella in a dog show.', 'Y', 'N', 7.6),
	('Modern Family', 'Message Received', 5, 22, 'Yes', 'Yes', 'Yes', 7, 5, 2014, 'Jay, Gloria and Manny challenge each other to step outside their comfort zone and try something new. Mitch and Cams wedding is getting too big and costly so they resort to selling a couple of their prized possessions, and the kids play a joke on Phil and Claire.', 'Y', 'N', 8.4),
	('Modern Family', 'The Weeding - 1', 5, 23, 'Yes', 'Yes', 'Yes', 14, 5, 2014, 'Mitch and Cam\'s big day is finally here and nothing can ruin it, until nothing turns into a whole lot of somethings and puts wedding planner extraordinaire Pepper Saltzman to the test. Meanwhile, Jay and Gloria host the Tuckers, Phil squeezes in an eye procedure before the festivities and Claire embraces her role as \'best woman\'.', 'Y', 'N', 8.2),
	('Modern Family', 'The Weeding - 2', 5, 24, 'Yes', 'Yes', 'Yes', 21, 5, 2014, 'The wedding day chaos continue as the entire party shifts from one contingency plan to another. Guests start to get testy, Mitchell and Cameron are feeling discouraged and poor Claire shows physical wear and tear, but an unexpected turn of events leads to the ceremony we\'ve all been waiting for.', 'Y', 'N', 8.6),
	('Modern Family', 'The Long Honeymoon', 6, 1, 'Yes', 'Yes', 'Yes', 24, 9, 2014, 'When Alex returns from a humanitarian trip, the family dynamic shifts; Cameron remains in a lovey-dovey mood even after the honeymoon ends; Gloria gives Jay a taste of his own medicine after noticing the lack of effort he puts into his appearance.', 'Y', 'N', 8),
	('Modern Family', 'Do Not Push', 6, 2, 'Yes', 'Yes', 'Yes', 1, 10, 2014, 'Jay and Gloria can\'t agree on what kind of anniversary gifts they want to exchange; the Dunphys go with Alex to Caltech for her college tour; Mitch, Cam and Lily take a new family portrait.', 'Y', 'N', 8),
	('Modern Family', 'The Cold', 6, 3, 'Yes', 'Yes', 'Yes', 8, 10, 2014, 'Phil must make creative edits in Cam and Mitch\'s wedding video when footage reveals that Phil is responsible for a terrible cold that has plagued the family. Gloria and Jay try to help Manny cope with stress in different ways.', 'Y', 'N', 7.9),
	('Modern Family', 'Marco Polo', 6, 4, 'Yes', 'Yes', 'Yes', 15, 10, 2014, 'The Dunphys stay in a cramped hotel room while the house is treated for mold. Gloria feels protective when Manny starts dating an older girl. Cameron wants to maintain his team\'s winning streak but fears Mitchell is a jinx.', 'Y', 'N', 8),
	('Modern Family', 'Won\'t You Be Our Neighbor', 6, 5, 'Yes', 'Yes', 'Yes', 22, 10, 2014, 'Phil is selling the house next door and he and Claire are excited by the prospect of having wonderful new neighbors, but that quickly turns into panic when a loud and obnoxious couple come to look at the house. Jay forbids Manny to see his new girlfriend when he realizes shes the granddaughter of his biggest business rival. Mitch and Cam are determined to switch Lily out of Mrs. Planks class since she is known to rule with an iron fist  and she also scares them.', 'Y', 'N', 8),
	('Modern Family', 'Halloween 3 - AwesomeLand', 6, 6, 'Yes', 'Yes', 'Yes', 29, 10, 2014, 'Claire allows Phil to take over Halloween this year, so he decides to turn the house into AwesomeLand. Cameron gets overwhelmed by the days activities. Mitchell has closing arguments for a huge case, and it doesnt help that the stenographer is dressed like a spider.', 'Y', 'N', 7.7),
	('Modern Family', 'Queer Eyes, Full Hearts', 6, 7, 'Yes', 'Yes', 'Yes', 12, 11, 2014, 'Phil and Claire don\'t know if they should be happy or concerned that Haley and Andy are spending a lot of time together, however, they soon find things are not what they appear. Gloria is pushing Manny to learn Spanish instead of French so she goes ahead and hires a Spanish tutor, Diego, who also happens to be very handsome, much to Manny and Jay\'s chagrin. Meanwhile, Mitch and Cam meet a popular news reporter at a school function and one of them piques her journalistic interest.', 'Y', 'N', 8.2),
	('Modern Family', 'Three Turkeys', 6, 8, 'Yes', 'Yes', 'Yes', 19, 11, 2014, 'Phil is cooking Thanksgiving dinner this year with Luke as his sous chef, and Claire has no confidence in them and prepares a secret turkey of her own as backup. Meanwhile, Jay and Gloria had plans to spend the holiday away but when the trip gets canceled last minute, they decide not to tell anyone which quickly becomes the worst idea ever since the family dinner gets suddenly moved to their house and it turns into a mad scramble to cover their tracks. Mitch is tired of always being the bad cop so when Lily refuses to wear a nice dress to dinner, he forces Cameron to deal with it who then comes up with a very unconventional approach.', 'Y', 'N', 8.4),
	('Modern Family', 'Strangers In The Night', 6, 9, 'Yes', 'Yes', 'Yes', 3, 12, 2014, 'When Alex tells Phil and Claire she has a boyfriend, they worry they\'ve put too much pressure on her and has made up an imaginary boyfriend. Jay and Gloria both have parties that they are dragging the other to and Jay has a clever plan to get himself out of it, but Manny just might spoil everything. Mitch and Cam just got a beautiful white couch delivered but when Mitch is stuck helping out Brenda, a distressed co-worker, and allows her to stay - it is a mishap waiting to happen.', 'Y', 'N', 7.6),
	('Modern Family', 'Haley\'s 21st Birthday', 6, 10, 'Yes', 'Yes', 'Yes', 10, 12, 2014, 'Haley is turning twenty-one and the whole family is taking her to a bar to celebrate! Claire really wants Haley to start seeing her as a friend rather than her uptight mom, Mitch and Cam make the sad realization that they may not be as cool as they thought, and Phil and Jays quick pit stop to pick up Haleys gift, a new car, becomes a disaster. Back at home, Alex, Luke and Manny babysit Lily and she decides to drop the where do babies come from? bomb.', 'Y', 'N', 8.1),
	('Modern Family', 'The Day We Almost Died', 6, 11, 'Yes', 'Yes', 'Yes', 7, 1, 2015, 'While driving out to get breakfast, the Dunphys plus Manny have a near death experience causing everyone to reevaluate their lives. Claire resolves to be more fun and less uptight, Haley and Alex agree not to fight anymore, Manny refuses to ever ride in a car again, Luke wants to check off his bucket list, Phil decides to be a take action type of guy, and the rest of the family has to bear the brunt of all the new attitudes.', 'Y', 'N', 8.2),
	('Modern Family', 'The Big Guns', 6, 12, 'Yes', 'Yes', 'Yes', 14, 1, 2015, 'Claire is furious about neighbors Ronnie and Ambers eye-sore of a boat on their front lawn and it soon becomes an all-out war when Phil calls in the big guns as back up -- his dad Frank and all his retired friends to give them a taste of their own medicine. Elsewhere, Jay is trying to potty train Joe but Gloria does not think hes ready yet, and Cam secretly takes Lily to clown school behind Mitchells back.', 'Y', 'N', 7.7),
	('Modern Family', 'Rash Decisions', 6, 13, 'Yes', 'Yes', 'Yes', 4, 2, 2015, 'Phil starts to feel the teenage cold shoulder from Luke and, with Andy hanging around a lot as his apprentice, he easily steps in as his new right hand man. Gloria and the doctors suspect that Joe might be allergic to Stella. Mitchell does some freelance legal work at Jays closet company and working with Claire becomes a very enlightening experience for the both of them.', 'Y', 'N', 7.5),
	('Modern Family', 'Valentine\'s Day 4 - Twisted Sister', 6, 14, 'Yes', 'Yes', 'Yes', 11, 2, 2015, 'Valentine\'s Day means \'Juliana\' and \'Clive\' are back, but things get worrisome when Claire starts sensing Phil may be more into Juliana than her. Jay goes from feeling disappointed to scared when Gloria\'s visiting sister becomes a larger deterrence for a romantic evening with Gloria than he thought. Mitchell and Cameron get themselves in a precarious situation with a good friend.', 'Y', 'N', 7.8),
	('Modern Family', 'Fight Or Flight', 6, 15, 'Yes', 'Yes', 'Yes', 18, 2, 2015, 'After a long reunion weekend with Phil\'s old cheer buddies, Claire jumps at the chance to snag the only first class seat left on the return flight home, leaving Phil in coach. Gloria forces Jay to teach Manny how to defend himself against a bully in his cooking class, but when things backfire it seems that the real bully might be someone else. Mitch, Cameron, Pepper and the whole gang throw Sal a belated baby shower.', 'Y', 'N', 7.9),
	('Modern Family', 'Connection Lost', 6, 16, 'Yes', 'Yes', 'Yes', 25, 2, 2015, 'Claires computer becomes the hub of all the familys activities when she gets stuck at the airport and is desperate to reach Haley after a big fight. After FaceTiming with Phil and the rest of the family to help track her down, Claire quickly turns to online snooping which inevitably becomes disturbing real quick and everyone gets sucked into the online drama.', 'Y', 'N', 9.5),
	('Modern Family', 'Closet - You\'ll Love It!', 6, 17, 'Yes', 'Yes', 'Yes', 4, 3, 2015, 'Jay and Claire shoot a Pritchett Closets commercial. A drone is spying on Gloria. Lily prepares to perform in her school talent show. Haley\'s feelings for Andy become even more complicated.', 'Y', 'N', 7.9),
	('Modern Family', 'Spring Break', 6, 18, 'Yes', 'Yes', 'Yes', 25, 3, 2015, 'Spring break has Claire doing some spring cleaning, while Phil struggles with not being a spring chicken when Luke starts outperforming him at seemingly everything. Haley takes Alex to a music festival to take her mind off of colleges, and Gloria and Jay challenge one another to give up Spanish soap operas and cigars respectively. However, when Gloria accompanies Cameron to his faculty talent show, she projects the soapy drama she craves onto Cams rivalry with Senor Kaplan, and Jay tags along with Mitchell to pick up Lily from camp so he can sneak a smoke.', 'Y', 'N', 7.4),
	('Modern Family', 'Grill, Interrupted', 6, 19, 'Yes', 'Yes', 'Yes', 1, 4, 2015, 'Jay\'s birthday brings everyone together and Phil is beside himself over the super cool gift he got Jay, a high-tech outdoor grill. Claire and Mitch decide they will \'offer\' to pay back the money Jay loaned them ages ago as their gift not really thinking he will take them up on it, and Gloria teaches Manny and Luke a lesson about drinking, while Andy gets real awkward with Haley when she brings over her new doctor boyfriend.', 'Y', 'N', 7.6),
	('Modern Family', 'Knock \'Em Down', 6, 20, 'Yes', 'Yes', 'Yes', 22, 4, 2015, 'Jay agrees to sub in on Cam\'s bowling team, not knowing it\'s an all-gay league. Phil and Clair have an unexpectedly nice time with their neighbors. Gloria and Mitch agree to go out with Haley.', 'Y', 'N', 8.2),
	('Modern Family', 'Integrity', 6, 21, 'Yes', 'Yes', 'Yes', 29, 4, 2015, 'Phil and Jay run an errand together to pick up Lily\'s hand me down princess castle for Joe, both though are in a mood because Phil is upset that Claire won\'t let him buy an arcade machine, and Jay thinks Gloria is letting Joe play with too many girlie items. Mitch and Cam babysit Joe and both get the itch for another baby -- that is until Joe presents to be quite the handful! Meanwhile, Gloria tries to help Haley stand up for herself at work, and Claire tries to bribe Luke\'s principal to give him one of the student awards this year.', 'Y', 'N', 7.9),
	('Modern Family', 'Patriot Games', 6, 22, 'Yes', 'Yes', 'Yes', 6, 5, 2015, 'Alex\'s worst nightmare is realized when she gets news that she has to share the Valedictorian title with her number one competitor, Sanjay! Both sets of parents get equally caught up in the rivalry and convince Principal Brown to let them break the tie via a gym grade they both have not completed - a one mile run. Elsewhere, Gloria is studying for her upcoming U.S. citizenship test and a visit from Javier throws her off her game, and Mitch and Cam blindly agree to join a protest against a local restaurant that they are actually secretly excited about.', 'Y', 'N', 8.3),
	('Modern Family', 'Crying Out Loud', 6, 23, 'Yes', 'Yes', 'Yes', 13, 5, 2015, 'The family is determined to make Alex celebrate her senior ditch day and Phil, Luke and Haley forcefully take her out but end up at an unexpected detour. Claire is torn when she gets a job offer from a big hotel chain but feeling torn quickly gets replaced with feelings of confusion when she cant tell whether or not Jay really cares if she stays or goes. And with Manny groggy off of pain killers from his wisdom teeth procedure, Gloria seizes the moment to put a sabotage plan into effect to break Manny and his new girlfriend up.', 'Y', 'N', 8.4),
	('Modern Family', 'American Skyper', 6, 24, 'Yes', 'Yes', 'Yes', 20, 5, 2015, 'The whole family is at Jay & Gloria\'s for Alex\'s graduation party, except for Phil, who ingeniously figured out a way to be there via skype and a robotic vessel after being unexpectedly detained in Seattle on a business trip. During the celebration, Jay frets about Gloria\'s cousin who has overstayed his welcome, Claire stresses out about giving Alex the perfect gift, Mitch hides news of being laid off from Cam and Andy\'s girlfriend, Beth, is in town stirring up a whole lot tension with Haley which finally leads to a realization that may have come too late', 'Y', 'N', 8.9),
	('Modern Family', 'Summer Lovin\'', 7, 1, 'Yes', 'Yes', 'Yes', 23, 9, 2015, 'Haley gets back together with Dylan.  Alex and Sanjay plan their breakup since they are both going off to college.  Mitchell avoids finding a new job and takes up art.  Jay and Gloria try to find a good preschool for Joe.', 'Y', 'N', 8),
	('Modern Family', 'The Day Alex Left For College', 7, 2, 'Yes', 'Yes', 'Yes', 30, 9, 2015, 'Phil and Claire are hurt when Alex lies about her college move-in date and Luke doesn\'t want to spend the day at Phil\'s open house being landlords stresses out Mitch and Cam.', 'Y', 'N', 8),
	('Modern Family', 'The Closet Case', 7, 3, 'Yes', 'Yes', 'Yes', 7, 10, 2015, 'Mitchell takes a job with a rival of Jay\'s. Luke and Manny visit Alex but use the opportunity to meet girls. Gloria is upset when a cheerleader doesn\'t decorate Manny\'s locker.  Phil and Claire try to play chicken when Dylan moves in.', 'Y', 'N', 8),
	('Modern Family', 'She Crazy', 7, 4, 'Yes', 'Yes', 'Yes', 14, 10, 2015, 'Phil convinces Lily to help with hatch the ducks he made a habitat for. Claire wants to impress her father with some ideas she has for the business. Cam spends time bonding with the frat guys.', 'Y', 'N', 7.8),
	('Modern Family', 'The Verdict', 7, 5, 'Yes', 'Yes', 'Yes', 21, 10, 2015, 'Gloria is excited at the possibility for being selected for jury duty.  Claire brings Alex and Haley to work and hopes to impress them. Phil takes Manny and Luke\'s class to community service day.', 'Y', 'N', 7.6),
	('Modern Family', 'The More You Ignore Me', 7, 6, 'Yes', 'Yes', 'Yes', 11, 11, 2015, 'Phil is surprised by Claire\'s reaction to Luke\'s arrest. Mitchell helps Gloria figure out the secret to her family sauce recipe.', 'Y', 'N', 7.6),
	('Modern Family', 'Phil\'s Sexy, Sexy House', 7, 7, 'Yes', 'Yes', 'Yes', 18, 11, 2015, 'Phil is selling an upscale home where various members of the family sneak off for alone time.', 'Y', 'N', 8.7),
	('Modern Family', 'Clean Out Your Junk Drawer', 7, 8, 'Yes', 'Yes', 'Yes', 2, 12, 2015, 'Gloria wins a silent auction to have a therapist come for an afternoon with the adults. Haley and Alex consider dumping their boyfriends.', 'Y', 'N', 7.9),
	('Modern Family', 'White Christmas', 7, 9, 'Yes', 'Yes', 'Yes', 9, 12, 2015, 'Gloria\'s plans for a White Christmas don\'t go as planned.', 'Y', 'N', 8.4),
	('Modern Family', 'Playdates', 7, 10, 'Yes', 'Yes', 'Yes', 6, 1, 2016, 'Haley, Alex and Luke scramble to fulfill their promise of a special day for Cameron; Gloria arranges a playdate with a couple at Joe\'s school.', 'Y', 'N', 7.8),
	('Modern Family', 'Spread Your Wings', 7, 11, 'Yes', 'Yes', 'Yes', 13, 1, 2016, 'Claire and the kids seize an opportunity to help expedite the ducks leaving the nest while Phil is off visiting Alex at college. Jay helps Mitch with Lily\'s sleepover with her friends from her Vietnamese dance troupe. Gloria and Cam are off on a hot pepper heist carefully orchestrated by Manny in order to meet a big hot sauce delivery deadline.', 'Y', 'N', 8.2),
	('Modern Family', 'Clean For A Day', 7, 12, 'Yes', 'Yes', 'Yes', 10, 2, 2016, 'Claire decides to get rid of all of the clutter out of the house before taking over Jay\'s business. Jay\'s new hobby causes concern for Cameron.', 'Y', 'N', 7.7),
	('Modern Family', 'Thunk In The Trunk', 7, 13, 'Yes', 'Yes', 'Yes', 17, 2, 2016, 'Phil feels unappreciated as Claire is busy running the closet business. A life-size standee of Gloria for her hot sauce display receives some unsavory attention. Cam and Mitch feel suspicious of their new renters.', 'Y', 'N', 7.7),
	('Modern Family', 'The Storm', 7, 14, 'Yes', 'Yes', 'Yes', 24, 2, 2016, 'A powerful storm hits Los Angeles and causes widespread power outages, so the entire Pritchett clan hunkers down at Jay and Gloria\'s house to use their generator. Meanwhile, Phil tries to make amends for an embarrassing moment, Mitchell and Cameron desperately try to save Lily\'s birthday party, and Haley turns on her charm for Andy.', 'Y', 'N', 8.2),
	('Modern Family', 'I Don\'t Know How She Does It', 7, 15, 'Yes', 'Yes', 'Yes', 2, 3, 2016, 'Jay and Gloria are suffering with a lack of sleep after Joe goes through a fussy phase.Claire\'s balance of life and work is so flawless and easy that her family is getting suspicious.Mitchell and Cameron are poorly treated at their friends\' wedding and wonder what they did to deserve it.', 'Y', 'N', 7.7),
	('Modern Family', 'The Cover-Up', 7, 16, 'Yes', 'Yes', 'Yes', 16, 3, 2016, 'Phil has a new client whom he tries to hide from his wife because she\'s attractive, while Claire would rather keep her hot yoga instructor a secret. Jay becomes preoccupied making a Web show, but is tormented by an Internet troll. Lily is nervous about learning to ride a bicycle, and her parents aren\'t exactly the best teachers.', 'Y', 'N', 8.2),
	('Modern Family', 'Express Yourself', 7, 17, 'Yes', 'Yes', 'Yes', 23, 3, 2016, 'Phil has the crazy idea of going on a spontaneous trip to Paris with Claire, the only problem is that they are both so ridiculously tired but try to push through it. Jay has taken over their bathroom remodel, which proves to be pretty hazardous for Gloria, Manny and Joe. Cameron\'s sister Pam is staying at the house after her husband has left her, but her emotional outbursts are driving Mitchell crazy. Haley and Andy go on a wild night bender.', 'Y', 'N', 7.8),
	('Modern Family', 'The Party', 7, 18, 'Yes', 'Yes', 'Yes', 6, 4, 2016, 'Manny and Luke babysit Lily so the adults in the family can have some fun, which includes Phil and Mitchell seeing a movie, Claire and Gloria going to a spa, and Jay and Cameron hitting a sports bar to watch a big fight, but Claire suspects the boys are going to throw a party.', 'Y', 'N', 8.6),
	('Modern Family', 'Man Shouldn\'t Lie', 7, 19, 'Yes', 'Yes', 'Yes', 13, 4, 2016, 'Claire brings home a stray dog and gets the kids to help her hide it from Phil while she tries to find its owner. Unfortunately, her evasive behavior only makes Phil try even harder to shower her with more attention. Elsewhere, Gloria invites a new couple over even after Jay has made it clear he doesn\'t want to make any new friends, but when the husband turns out to be a real guy\'s guy, Jay might be eating crow. And Cameron rents out their upstairs apartment to a Christian rock band.', 'Y', 'N', 7.8),
	('Modern Family', 'Promposal', 7, 20, 'Yes', 'Yes', 'Yes', 4, 5, 2016, 'With Closet-Con right around the corner, Claire is on high alert and convinced there is a mole in the company. Meanwhile, Phil goes vigilante when he and Gloria confront Auntie Alice for stealing her hot sauce recipe. Jay tries to teach Joe how to do some manly handy work, and with prom coming up, Mitch helps Luke with his \'promposal\' while Cam helps with Manny\'s, but Cam goes a little overboard, revealing that there maybe something deeper going on.', 'Y', 'N', 7.6),
	('Modern Family', 'Crazy Train', 7, 21, 'Yes', 'Yes', 'Yes', 11, 5, 2016, 'Dede is getting remarried, and Manny convinces the family to take the train up to the wedding. Jay could not be more ecstatic that Dede has moved on for good but his overenthusiasm might come back and bite him later. Claire and Mitchell work on their toast while Phil and Cam geek out over their favorite author, who is also on the train. Luke and Manny go a little girl crazy; Gloria gets stuck in coach; and Alex gets caught up in the romance of the train herself.', 'Y', 'N', 8.1),
	('Modern Family', 'Double Click', 7, 22, 'Yes', 'Yes', 'Yes', 18, 5, 2016, 'Claire cant seem to find the right time to fire one of her employees, while, back at home, Phil thinks he caught Luke with a girl in his bed, and no one seems to notice that Alex has moved back home for the summer. Jay refuses to accept that it might be harder to reenter the workforce than he thought, and Cameron and Mitch butt heads on how to share time with Lily now that Cameron took a summer job in Kansas City.', 'Y', 'N', 8.3),
	('Modern Family', 'A Tale Of Three Cities', 8, 1, 'Yes', 'Yes', 'No', 21, 9, 2016, 'After recent trips take the Dunphys to New York, Mitch, Cam, and Lily to the Midwest, and Jay, Gloria, Manny, and Joe to Juarez, Mexico, the Pritchett-Dunphy-Tucker clan reunites.', 'N', 'N', 8.1),
	('Modern Family', 'A Stereotypical Day', 8, 2, 'Yes', 'Yes', 'No', 28, 9, 2016, 'A new family moves in across the street from the Pritchetts and Jay wants to make a good impression. Manny hopes his deeds will catch the attention of a pretty teenage radical. The Dunphys try to look on the bright side of Alex\'s bout with mono. Mitch and Cam are shocked to overhear Lily disrespect a new friend.', 'N', 'N', 7.7),
	('Modern Family', 'Blindsided', 8, 3, 'Yes', 'Yes', 'No', 5, 10, 2016, 'Luke and Manny go head-to-head in a race to be class president, but the campaign might be more of a battle between their parents. Phil introduces Haley to a marketing genius to help with her promotion business. Cam goes to extremes to keep his best football player from leaving the school.', 'N', 'N', 7.5),
	('Modern Family', 'Weathering Heights', 8, 4, 'Yes', 'Yes', 'No', 12, 10, 2016, 'Phil can\'t cover up his excitement when he\'s invited to appear in a real-estate news segment for the local news. The day gets even better after meeting his \'weatherman\' hero, Rainer Shine. Phil made one little mistake; he introduced him to Hayley. Over at the Pritchett house, Jay decides to infuse a little grit into Manny\'s video interview for his college application. In the Tucker-Pritchett home, Lily is over their new houseguest and decides to take matters into her own hands.', 'N', 'N', 7.7),
	('Modern Family', 'Halloween 4 - The Revenge Of Rod Skyhook', 8, 5, 'Yes', 'Yes', 'No', 26, 10, 2016, 'Luke hosts a Halloween party that quickly turns into a nightmare, so the Dunphys come up with a plan to make it a success and rescue his reputation. Cam confronts his holiday nemesis, but Mitch and Lily try to keep him from going overboard. Jay plots revenge on an old adversary when he finds out where Manny is going to a party.', 'N', 'N', 7.7),
	('Modern Family', 'Grab It', 8, 6, 'Yes', 'Yes', 'No', 9, 11, 2016, 'Jay\'s only sanctuary and favorite place in the world begins to lose its charm when Phil starts to think about becoming a member. Claire misjudges her influence over Alex\'s choices. Hayley wants to impress Alex with her life choices.', 'N', 'N', 7.3),
	('Modern Family', 'Thanksgiving Jamboree', 8, 7, 'Yes', 'Yes', 'No', 16, 11, 2016, 'Cameron spares no expense for his Thanksgiving jamboree. Hayley tells Phil she\'d rather spend the holiday with her new boyfriend. Jay works to keep his blood pressure down. Alex and Dwight get closer.', 'N', 'N', 7.4),
	('Modern Family', 'The Alliance', 8, 8, 'Yes', 'Yes', 'No', 30, 11, 2016, 'Hayley\'s plan for a fun-filled girl\'s day with Rainer Shine\'s teen daughter may be a little more angst-filled than expected. Luke finds himself in a compromising position with a widow at the club and unwittingly helps Jay with his petition. Gloria, Phil and Cam have formed a secret alliance to ensure their respective \'mistakes\' are concealed from their spouses.', 'N', 'N', 8.4),
	('Modern Family', 'Snow Ball', 8, 9, 'Yes', 'Yes', 'No', 14, 12, 2016, 'A fancy holiday gala at school finds Manny and Luke trying to avoid a disastrous outcome thanks to a texting mistake. Eager to pitch in, Claire, Gloria, Mitchell and Cameron volunteer to help at the dance and get involved in the night\'s shenanigans, including Claire and Gloria trying to set up a single mom with the principal, while Mitchell takes an interest in the school bully.', 'N', 'N', 7.2),
	('Modern Family', 'Ringmaster Keifth', 8, 10, 'Yes', 'Yes', 'No', 4, 1, 2017, 'Trying to recover from his Thanksgiving debacle, Cam decides to treat the family to a New Year\'s Day feast. After realizing that Cam\'s recent attempt is also a complete fail and in order to salvage their meal, Mitch uses a \'concierge gift card\' that he received as a Christmas gift. Cam soon discovers that the concierge who is on his way to save the day is none other than his ex-boyfriend, Keifth (Kelsey Grammar), a former circus ringmaster who left him without saying goodbye. Meanwhile, Phil\'s dad, Frank (Fred Willard) arrives with his new girlfriend, who happens to be Phil\'s childhood babysitter, which sets him on a confusing tailspin. Finally, Gloria and Jay have to decide who should take care of little Joe if something should ever happen to them.', 'N', 'N', 7.4),
	('Modern Family', 'Sarge & Pea', 8, 11, 'Yes', 'Yes', 'No', 11, 1, 2017, 'Cam is upset about a rude parent that cost him a precious moment during Lily\'s dance recital. During a visit to Alex\'s coffee shop with Hayley, Cam believes he has spotted the anonymous parent and goes to extreme lengths to verify.', 'N', 'N', 7.3),
	('Modern Family', 'Do You Believe In Magic', 8, 12, 'Yes', 'Yes', 'No', 8, 2, 2017, 'Fearful that the romance between him and Claire is fizzling, Phil calls upon his alter ego, Clive Bixby, get Valentines day back on track. Jay shows a bit of child favoritism when he and Gloria must deal with Joe\'s inappropriate Valentine gift-giving and Manny\'s dating indecisiveness. When Cam and Mitch try to empower Lily, Haley and Sal to stand up to the men in their lives, things don\'t turn out as planned and go overboard. Alex discovers she has a secret admirer who may be a little too involved with family.', 'N', 'N', 7.9),
	('Modern Family', 'Do It Yourself', 8, 13, 'Yes', 'Yes', 'No', 15, 2, 2017, 'Phil eyes a property he\'s always had a desire to develop and wants Jay to be a coinvestor. Claire\'s fondness for a TV chef leads to a new love of cooking Sunday dinners. Mitch and Cam try to teach Lily the value of hard work. Jay feels left out when Gloria hires a coach for Joe who doubles as a handyman.', 'N', 'N', 7.3),
	('Modern Family', 'Heavy Is The Head', 8, 14, 'Yes', 'Yes', 'No', 22, 2, 2017, 'Despite their lofty hopes, Phil and Jays property investment might turn out to be a bust, forcing Phil to rethink his original dream. Meanwhile, Cam lands in the hospital due to a head injury and refuses to have an MRI thanks to a traumatic incident with a well when he was a child. Determined to finally impress Claire and keep her from re-gifting her birthday present, Gloria surprises her with a day of luxury at the office. However, after Claire had to implement some rather harsh budget cuts at work, a massage at her desk may not be sending the right message.', 'N', 'N', 7.2),
	('Modern Family', 'Finding Fizbo', 8, 15, 'Yes', 'Yes', 'No', 1, 3, 2017, 'Cam is enraged when he receives an online video showing someone has been desecrating his beloved Fizbo costume, which sets him on a quest to restore Fizbos good name. Phil is in for quite the surprise when he finally meets his new soon-to-be step-brother at Franks bachelor party. Mannys newest play hits a little too close to home for Gloria, Claire, and Haley when he enlists them to do a read through before he submits it to a young playwright festival.', 'N', 'N', 6.8),
	('Modern Family', 'Basketball', 8, 16, 'Yes', 'Yes', 'No', 8, 3, 2017, 'After choking at last years charity basketball game, Phil has been training all year to redeem himself. However, when NBA stars Charles Barkley and DeAndre Jordan attend the game and start making bets, Phil tries to not buckle under the pressure. Gloria has to step-up at Mannys school when her nemesis, Donna Duncan, tries to shame her for her lack of support at the school. Claire does whatever it takes to keep a work mistake secret from Jay, while Jays concerned that Joe doesnt have a healthy fear of him at all.', 'N', 'N', 7.2),
	('Modern Family', 'Pig Moon Rising', 8, 17, 'Yes', 'Yes', 'No', 15, 3, 2017, 'Mitchell knocks over an urn filled with the ashes of Cameron\'s beloved pet pig Lilly while exercising in the garage, but Cameron suspects his cover-up is a load of hogwash.', 'N', 'N', 7.6),
	('Modern Family', 'Five Minutes', 8, 18, 'Yes', 'Yes', 'No', 29, 3, 2017, 'Mitch and Cam have five minutes to catch a new flight while fighting the effects of sleeping pills they took prematurely. Then at Rainers birthday dinner, Haley and Rainer are forced to reevaluate their entire relationship in the five minutes before the birthday cake arrives. Phil and Claire pay a surprise visit to Alex and are given a five-minute surprise introduction to her new boyfriend. With only five minutes to catch a movie, Manny has to find the perfect parking space and endure Jay and Glorias backseat argument.', 'N', 'N', 7.3),
	('Modern Family', 'Frank\'s Wedding', 8, 19, 'Yes', 'Yes', 'No', 5, 4, 2017, 'Frank Dunphy\'s wedding has a Roaring \'20s theme, so Phil gets his clan to show up in costume, but Claire and the kids realize it\'s time for an intervention with Phil when they\'re the only ones who dressed up. Jay comes to regret mastering the art of saying \'no\'. Cam finally gets the courage to stand up to his sister Pam.', 'N', 'N', 7.4),
	('Modern Family', 'All Things Being Equal', 8, 20, 'Yes', 'Yes', 'No', 3, 5, 2017, 'Gloria, Claire, Haley, Alex, Lily, Luke and Manny are equally committed to showing their support for gender equality and the womens movement in very different ways. Meanwhile, Jay and Phil are at odds on how their parking lot attendant, Joan, should be running their lot, and jealousy ensues when Pam prefers Mitchells help over Cams with her baby.', 'N', 'N', 5.9),
	('Modern Family', 'Alone Time', 8, 21, 'Yes', 'Yes', 'No', 10, 5, 2017, 'Mitch and Jay end up at the same resort when they separately seek out a retreat from the family; Phil and Claire struggle to enjoy empty-nester life; not knowing what to do with himself while Mitch is away, Cam drops in on Gloria.', 'N', 'N', 7.7),
	('Modern Family', 'The Graduates', 8, 22, 'Yes', 'Yes', 'No', 17, 5, 2017, 'When Manny\'s father arrives for his graduation and takes him out on a wild night to celebrate, Jay steps in to restore matters; the Pritchett-Dunphy-Tucker crew gets emotional as they prepare for Luke and Manny\'s big day.', 'N', 'N', 7.6),
	('Monk', 'Mr. Monk And The Candidate - 1', 1, 1, 'Yes', 'Yes', 'No', 12, 7, 2002, 'Three years after losing his job with the San Francisco Police Department because of his obsessive/compulsive disorder, Monk is working as a private consultant investigating the murder of a young woman named Nicole Vasquez. Shortly after determining that the murderer was at least 6\'3\', smoked menthol cigarettes, and wore slippers, Monk receives a call from his former boss, Captain Stottlemeyer, who reluctantly requests his aid in discovering the would-be assassin of mayoral candidate Warren St. Claire. While at least three people (including Mrs. St. Claire) seem to have sufficient motive to kill the candidate, the Vasquez murder seems to be unmotivated. Despite the captain\'s skepticism, Monk is certain that the cases are related. The police get a lead on the would-be assassin, but he manages to escape, in part because of Monk\'s fear of heights. Sharona convinces the deputy mayor to let Monk continue his investigation despite Captain Stottlemeyer\'s objections. After Monk has gathered the suspects together to recreate the crime scene, the hitman takes a shot at his accomplice and Sharona, playing Lois Lane, follows him into a sewer. Overcoming his revulsion, Monk goes in after them, placing Kleenex on the rungs of the ladder to protect his hands and feet on the way down. But Kleenex won\'t protect his shoes or the cuffs of his pants from the filthy, six-inch deep water. This novel act of courage moves Monk one step closer to recovering his emotional stability--and getting his old job back.', 'Y', 'N', 8.5),
	('Monk', 'Mr. Monk And The Candidate - 2', 1, 2, 'Yes', 'Yes', 'No', 12, 7, 2002, 'Three years after losing his job with the San Francisco Police Department because of his obsessive/compulsive disorder, Monk is working as a private consultant investigating the murder of a young woman named Nicole Vasquez. Shortly after determining that the murderer was at least 6\'3\', smoked menthol cigarettes, and wore slippers, Monk receives a call from his former boss, Captain Stottlemeyer, who reluctantly requests his aid in discovering the would-be assassin of mayoral candidate Warren St. Claire. While at least three people (including Mrs. St. Claire) seem to have sufficient motive to kill the candidate, the Vasquez murder seems to be unmotivated. Despite the captain\'s skepticism, Monk is certain that the cases are related. The police get a lead on the would-be assassin, but he manages to escape, in part because of Monk\'s fear of heights. Sharona convinces the deputy mayor to let Monk continue his investigation despite Captain Stottlemeyer\'s objections. After Monk has gathered the suspects together to recreate the crime scene, the hitman takes a shot at his accomplice and Sharona, playing Lois Lane, follows him into a sewer. Overcoming his revulsion, Monk goes in after them, placing Kleenex on the rungs of the ladder to protect his hands and feet on the way down. But Kleenex won\'t protect his shoes or the cuffs of his pants from the filthy, six-inch deep water. This novel act of courage moves Monk one step closer to recovering his emotional stability--and getting his old job back.', 'Y', 'N', 8.4),
	('Monk', 'Mr. Monk And The Psychic', 1, 3, 'Yes', 'Yes', 'No', 19, 7, 2002, 'A panicky woman driver goes off the road thanks to a skid block placed by her husband, former police commissioner Harry Ashcombe. The next morning  Dolly Flint, a psychic on first name terms with Captain Stottlemeyer (who has arrested her three times on bunko charges) wakes up in her car next to the site of the staged accident. Dolly insists that she was led to the site by the dead woman\'s \'aura\', but Monk is suspicious. At the memorial service held in the dead woman\'s expensive home, Monk figures out what the audience already knows that Ashcombe is the murderer. With the aid of Ashcombe\'s mistress, Monk, the captain, and Dolly stage a psychic \'reading\' to catch the killer. Eight out of ten.', 'Y', 'N', 7.8),
	('Monk', 'Mr. Monk Meets Dale The Whale', 1, 4, 'Yes', 'Yes', 'No', 26, 7, 2002, 'A 911 call from a judge identifies the man who is about to murder her as rich and obscenely fat financier Dale Biederbeck. But \'\'Dale the Whale\'\' weighs over 800 pounds and can\'t get up from his bed, making it impossible for him to have commited the murder, despite the 911 call and the testimony of a ten-year-old witness who saw an extremely fat man through the window of the judge\'s house. The fact that Biederbeck sued Monk\'s wife for libel after she criticized his ethics in a newspaper article gives Monk added incentive to find him guilty. While Monk and Captain Stottlemeyer try to figure out how Dale could have committed the murder, Sharona gets her chance to play Lois Lane, or rather Florence Nightingale, by briefly serving as Biederbeck\'s nurse instead of Monk\'s. She also finds herself attracted to Dale\'s private physician, Christian (kristy AN) Vezza.', 'Y', 'N', 7.8),
	('Monk', 'Mr. Monk Goes To The Carnival', 1, 5, 'Yes', 'Yes', 'No', 2, 8, 2002, 'Officer Adam Kirk, an old friend of Stottlemeyer\'s, steps off a ferris wheel to find the young man he was riding with dead from a knife in his chest. Stottlemeyer has no choice but to arrest his friend and advise him to remain silent. He enlists Monk to investigate the case unofficially, even though Monk believes the hair-triggered cop is guilty. Matters are complicated when a criminal Kirk is charged with beating is released for lack of evidence, and more so when Monk discovers that the bruises on the victim\'s body were self-inflicted. Meanwhile, Stottlemeyer is forced by his conscience to state that Monk is not ready to rejoin the force and to endure the resentment of both Monk and Sharona as a result of this decision. When Monk, still furious with Stottlemeyer, figures out what really happened, he and Sharona return to the carnival and Sharona climbs aboard the ferris wheel to spot the escaping criminal because Monk is too afraid of heights to do it himself. But the criminal is hidi', 'Y', 'N', 7.9),
	('Monk', 'Mr. Monk Goes To The Asylum', 1, 6, 'Yes', 'Yes', 'No', 9, 8, 2002, 'After attempting to prepare his dead wife\'s favorite dinner in her old house to celebrate the anniversary of the day they met, Monk is arrested for unlawful entry and is taken to Medford Psychiatric Institute for forty-eight hours of psychiatric observation. His roommate, overly empathic John Wurster (\'\'I\'m a detective, too!\'\'), informs him of an unsolved murder four years earlier, while another inmate, Manny, involves him in a quest to discover Santa Claus on the asylum roof. In addition to Dr. Lancaster\'s orders not to play detective during his stay at Medford, Monk finds his quest to solve the two \'\'cases\'\' thwarted by apparent slips of memory--a picture he doesn\'t remember drawing and another patient\'s necklace that has found its way into his pocket. After the necklace incident, Monk finds himself strait-jacketed in the \'\'choir room\'\' as the doctor\'s sinister aide goes upstairs for four cc\'s of Thorazine. Meanwhile, Sharona, who hears about the murder on a visit to Monk, examines the mur', 'Y', 'N', 8),
	('Monk', 'Mr. Monk And The Billionaire Mugger', 1, 7, 'Yes', 'Yes', 'No', 16, 8, 2002, 'When billionaire software magnate Sidney Teal is shot dead by ex-cop Archie Modine after allegedly turning mugger and another policeman mysteriously flees the scene, Stottlemeyer calls in Monk to investigate. Not only is the idea of a billionaire turning mugger hard to swallow, the circumstances of the mugging are suspicious. Why, for example, would a mugger wear knee and elbow pads? Meanwhile, Sharona threatens to quit (this time for sure) when her paycheck bounces, and Stottlemeyer is hounded by reporters demanding information on \'\'Fraidy Cop.\'\' Unable to continue the investigation without Sharona\'s help, Monk returns to the seemingly unsolvable mystery of his wife\'s murder only to find that his \'\'new\'\' clue isn\'t new; he\'s already talked to writer Kelly Street three times. Sharona finds that selling lamps isn\'t nearly as much fun as working for Monk (with or without money) and comes to the rescue with a new clue involving Teal and Modine.', 'Y', 'N', 7.9),
	('Monk', 'Mr. Monk And The Other Woman', 1, 8, 'Yes', 'Yes', 'No', 23, 8, 2002, 'When a lawyer and his assistant are murdered, suspicion falls on a disgruntled client whose burnt file is found in the wastebasket. When the suspect, Grayson, is also murdered, Stottlemeyer is certain that Grayson\'s neighbor, a pretty blonde named Monica Waters who has been feuding with Grayson for two years about her garage, is guilty of all three murders. But Monk is attracted to Monica, who bears a slight resemblance to Trudy. Because Monica\'s absent husband had OCD, she understands Monk in a way that Sharona can\'t, which of course adds to the attraction. Even her garage is perfect, exactly the way Monk would want his garage to be organized if he ever had one. A touching bond forms between them until a call from Stottlemeyer leads him to suspect that Monica may really be the murderer.', 'Y', 'N', 8.1),
	('Monk', 'Mr. Monk And The Marathon Man', 1, 9, 'Yes', 'Yes', 'No', 13, 9, 2002, 'A woman is murdered during the San Francisco marathon and Monk suspects her married lover, Trevor McDowell, even though he was running in the race. Although McDowell disappears from the video tape of the race less than halfway through and reappears only at the end, the data from a computer chip indicates that he was present at all checkpoints during the race. After interrogating the murdered woman\'s ex-husband as a possible suspect only to find that his alibi is probably credible, a frustrated Stottlemeyer provides Monk with a brilliant suggestion--that the computer chip was passed off to someone else during the race. Monk meanwhile has the chance to visit his hero, an aging runner from Nigeria whom Sharona briefly suspects may be the murderer\'s accomplice--a theory Monk refuses even to consider. When Monk figures out what really happened, he must catch the murderer himself to prove his theory.', 'Y', 'N', 7.8),
	('Monk', 'Mr. Monk Takes A Vacation', 1, 10, 'Yes', 'Yes', 'No', 20, 9, 2002, 'Monk\'s beach resort vacation with Sharona and Benjy turns into work when Benjy witnesses a murder. But with no body to be found and \'\'the cleanest crime scene in the history of crime,\'\' Benjy can\'t convince anyone except Monk and the hotel\'s kooky security chief that he\'s telling the truth. Believing that Benjy\'s imagination is working overtime and determined to enjoy her vacation, Sharona takes unneeded tennis lessons from yet another Mr. Wrong while Monk and his new assistant follow what turns out to be a false lead. Benjy spots the body only to have it disappear again, and the security chief reveals Monk\'s own room to be contaminated with some of the \'\'fourteen bodily fluids\'\' detected by her sonar machine. When Monk figures out who stole four bags of lime from the grounds supervisor\'s shed, he solves the case. Unfortunately, his time at the hotel is almost up and the body still has not been found.', 'Y', 'N', 8.2),
	('Monk', 'Mr. Monk And The Earthquake', 1, 11, 'Yes', 'Yes', 'No', 4, 10, 2002, 'A wealthy businessman is apparently killed in an earthquake, but Monk is sure that he was murdered by his wife. The trauma of the earthquake temporarily worsens Monk\'s condition by causing him to talk gibberish, but he recovers soon enough to communicate his suspicions to the beleaguered captain, who has his hands full with fires, false alarms, and looters. Meanwhile Sharona is forbidden to enter her apartment because of earthquake damage, so she and Benjy are forced to spend the next few days with Sharona\'s snippy and competitive sister, Gail. They are quickly joined by Monk and Sharona\'s latest Mr. Wrong, whom the viewer knows is really the lover of the dead man\'s wife. Complications arise when the conspirators decide that Sharona knows too much and Monk, who has mentally reconstructed the crime, again loses the power to speak English after going through an aftershock. The captain, who has just begun to investigate a second murder in Sharona\'s neighborhood, receives an untelligible c', 'Y', 'N', 7.8),
	('Monk', 'Mr. Monk And The Red-Headed Stranger', 1, 12, 'Yes', 'Yes', 'No', 11, 10, 2002, 'Country singer Willie Nelson, who portrays himself, becomes the prime suspect when his manager is murdered, but the only witness is a blind woman who claims to have overheard a scuffle and can identify Willie as the murderer by his voice. At first Stottlemeyer (who is on the case despite a broken arm) is reluctant to arrest the famous singer on such shaky evidence, but a video tape convinces him that Willie must indeed be guilty. But for Monk, the fact that a note used to lure the victim to his death refers to him as \'\'J. Cross\'\' while Willie refers to him as \'\'Sonny\'\' casts doubt on the blind woman\'s story. Determined for the sake of his dead wife, Trudy, a devoted fan, to prove the singer innocent, Monk interviews the blind woman and investigates the manager\'s less than reputable background, searching for the clue he needs to clear the singer\'s name.', 'Y', 'N', 7.9),
	('Monk', 'Mr. Monk And The Airplane', 1, 13, 'Yes', 'Yes', 'No', 18, 10, 2002, 'Thinking that he\'s just accompanying Sharona to the airport to pick up her aunt, Monk discovers to his dismay that she\'s the one making the flight. The choice between being on his own without Sharona or flying cross-country to New Jersey is a tough one, but he overcomes his fears and boards the plane. After annoying the passengers and crew with his first-time-flyer questions, he becomes even more unsettled after small anomalies convince him that the Frenchman sitting across the aisle has murdered his wife and the woman accompanying him is an imposter. He calls Captain Stottlemeyer only to find that it\'s the captain\'s day off but manages to persuade Lt. Disher to search the airport for a body. With on-and-off help from Sharona (who would rather be \'\'helping\'\' Tim Daly decide whether to accept a role in an upcoming film) and from the extension cord salesman in the seat next to him, Monk tries to provide the evidence Disher needs to order the arrest. Meanwhile another murder is committed wh', 'Y', 'N', 8.4),
	('Monk', 'Mr. Monk Goes Back To School', 2, 1, 'Yes', 'Yes', 'No', 20, 6, 2003, 'When English teacher Beth Landow falls from the clock tower at Trudy\'s former high school, the assistant principal doubts the police department\'s conclusion that the death was a suicide and invites Monk to investigate. Monk quickly concludes that the suicide note is a forgery: a highly respected English teacher wouldn\'t confuse \'\'its\'\' with \'\'it\'s.\'\' A few words with the teachers in the lounge lead him to suspect that the murderer is a science teacher, Derek Philby. Unfortunately for Monk, Philby was proctoring an SAT exam when Ms. Landow\'s body landed on Philby\'s car, setting off his car alarm and alerting the entire school to her death. Armed with a strong suspicion but no evidence, Monk becomes a substitute teacher in hopes of finding the information that will incriminate Philby, who arrogantly informs him that he\'s \'\'failing the class\'\'--he has no evidence to support his hypothesis. Faced with students who throw erasers at him, an irate father who is also the school\'s gym teacher threat', 'Y', 'N', 8.2),
	('Monk', 'Mr. Monk Goes To Mexico', 2, 2, 'Yes', 'Yes', 'No', 27, 6, 2003, 'When a friend\'s college-age son dies mysteriously in Mexico, the mayor sends Monk to investigate. Doubting the coroner\'s report that the young man \'\'drowned\'\' in mid-air, Monk nevertheless has difficulty concentrating on the case. His eighteen suitcases carrying not only his clothes and \'\'back-up pillowcases\'\' but a year\'s supply of food and his favorite brand of bottled water are stolen, leaving him with nothing he considers safe to eat or drink. Even worse, someone is trying to kill him, first by running him down with a pick-up truck and then by planting an explosive device behind a picture that he compulsively straightens every time he enters his room. Neither the witnesses nor the police, a south-of-the-border caricature of Stottlemeyer and Disher, offer any helpful leads--except for the mention of another unsolved murder, this one a mauling by a \'\'wild lion,\'\' the previous year. The fact that both victims were from San Francisco offers Monk the clue that he needs to solve the case and e', 'Y', 'N', 8.2),
	('Monk', 'Mr. Monk Goes To The Ballgame', 2, 3, 'Yes', 'Yes', 'No', 11, 7, 2003, 'When tyrannical CEO Lawrence Hammond and his pretty young wife are murdered at night in a deserted parking lot, Stottlemeyer suspects the CEO\'s many enemies, but Monk notes that the wife was shot four times and the husband only once, meaning that she was the primary target and the husband \'\'an afterthought.\'\' The only clues are the CEO\'s last words, obsessively repeated: \'\'Girls can\'t eat fifteen pizzas\'\' and a computerized navigation system that apparently malfunctioned. A talk with the housekeeper and an examination of the wife\'s separate bedroom lead Monk to an art studio, where he reluctantly interviews a nude male art instructor and discovers that the wife was having an affair with Major League superstar Scott Gregorio, who was attending the same classes. Gregorio, whose on-field performance has deteriorated since an earlier attack by an assailant with a baseball bat, is clearly devastated by Mrs. Hammond\'s death and is more a victim himself than a suspect. Seeing his own loss of Tr', 'Y', 'N', 7.8),
	('Monk', 'Mr. Monk Goes To The Circus', 2, 4, 'Yes', 'Yes', 'No', 18, 7, 2003, 'When a sarcastic and unpopular ringmaster is murdered by an acrobat wearing a face mask and a Ninja-like costume, Stottlemeyer suspects an animal trainer who not only has a motive (he\'s the former lover of the ringmaster\'s dinner date) but also owns the murder weapon. Monk, however, suspects the ringmaster\'s ex-wife, a trapeze artist billed as \'\'the Queen of the Sky\'\' who is also a sharpshooter. Unfortunately for Monk\'s theory, the trapeze artist, Natasia Lovara, has a broken foot, confirmed by X-rays. The mystery, as in \'\'Billionaire Mugger\'\' and \'\'Dale the Whale,\'\' is not who did it but how it was done. Meanwhile, the everythingaphobic Monk alienates Sharona by telling her that her fear of elephants is irrational and advising her to \'\'suck it up.\'\' Only when the elephant actually crushes its trainer\'s head in front of both Monk and Sharona does he begin to empathize with her and attempt to offer her the sort of comfort and understanding that she routinely offers him. Having been informed b', 'Y', 'N', 8),
	('Monk', 'Mr. Monk And The Very Very Old Man', 2, 5, 'Yes', 'Yes', 'No', 25, 7, 2003, 'In an attempt to stabilize his shaky marriage, Captain Stottlemeyer redecorates his office with the New Age artifacts that his \'\'hippie wife,\'\' Karen, has given him, but he can\'t bring himself to watch the documentary that she spent forty-five thousand dollars to film. When Karen thinks that her documentary subject--the world\'s oldest man--was murdered, the captain rejects the suggestion as absurd but calls in Monk to pacify her. Unfortunately for the captain, Monk agrees with Karen, and Stottlemeyer finds himself on Monk\'s front porch with two packed suitcases. Monk, glad for a chance to repay the captain for helping him through his three-and-a-half year \'\'slump,\'\' invites him to stay as long as he needs to. Predictably, they both end up with frazzled nerves and very little sleep. Depressed over his own \'\'slump\'\' and his inability to solve a five-year-old case involving the death of a seventeen-year-old boy, the captain becomes even more despondent when Monk finds a clue that he missed in', 'Y', 'N', 8.1),
	('Monk', 'Mr. Monk Goes To The Theater', 2, 6, 'Yes', 'Yes', 'No', 1, 8, 2003, 'Sharona\'s actress sister, Gail, is suspected of murdering Hal Duncan, a fellow actor who dies onstage after Gail stabs him with what she insists is a retractable knife. When Sharona\'s mother (who thinks that Sharona is Monk\'s partner, not his assistant) arrives for a visit and Sharona tells her the bad news, Monk and Sharona promise to \'\'do whatever it takes\'\' to discover what really happened. \'\'Whatever it takes\'\' turns out to be a bit more than Monk bargained for, however. After talking with the props manager, he begins to suspect that Jenna Ryan, Gail\'s understudy, somehow killed Duncan and framed Gail, even though she was at a party on the other side of town when Duncan died. In order to talk with and observe Jenna, he endures a painful half hour at a speed dating service and even agrees to take the dead man\'s part in the play for two days until a new actor arrives. While Monk is on stage battling stage fright and fully aware that one of the knives on the stage is real, Sharona searche', 'Y', 'N', 8.2),
	('Monk', 'Mr. Monk And The Sleeping Suspect', 2, 7, 'Yes', 'Yes', 'No', 8, 8, 2003, 'In a new twist on the \'\'how could he (or she) possibly have done it\'\' theme that we saw first in \'\'Dale the Whale,\'\' Monk suspects that the man responsible for the mail bombing murder of rich and beautiful Amanda Babbage is the victim\'s brother, Brian--who has been in a coma for four months after attempting to lure Stottlemeyer and Disher into a car chase and crashing into two cars. Since the package was postmarked three days before the bombing, Stottlemeyer is naturally skeptical, but he prefers siding with Monk to tagging along behind Agent Grooms of the Bureau of Alcohol, Tobacco, and Firearms, who suspects the victim\'s other brother, Ricky. Monk, meanwhile, has other problems. Dr. Kroger is leaving for a three-week vacation, Sharona\'s ex-husband wants her to come back to him and leave her job, and he temporarily loses most of his hearing after being caught in the explosion of another bomb. Depressed and lonely, Monk confides his woes to the comatose suspect--and makes a near-fatal blun', 'Y', 'N', 8.3),
	('Monk', 'Mr. Monk Meets The Playboy', 2, 8, 'Yes', 'Yes', 'No', 15, 8, 2003, 'Suspecting that her boss, Elliott D\'Souza, has been murdered by playboy/publisher Dexter Larsen after withdrawing his financial backing for Larsen\'s Sapphire magazine, D\'Souza\'s secretary hires Monk to investigate. After enlisting the help of the initially reluctant Stottlemeyer and Disher and convincing them that D\'Souza\'s death was no accident despite his being alone in a room locked from the inside, Monk suddenly tries to withdraw from the case. The reason? Larsen has obtained and is threatening to publish nude photographs of Sharona, relics of her past as a struggling single mother in Atlantic City. When Sharona discovers the reason for Monk\'s strange behavior, her first reaction is shame and fear, but Benjy\'s response to her partial confession arms her with fierce determination to retrieve the photos and \'\'nail\'\' the murderer. Through the common bond of motherhood, she persuades the Sapphire Girl who had provided Dexter\'s alibi to confess the truth. Meanwhile, Monk puts together De', 'Y', 'N', 7.8),
	('Monk', 'Mr. Monk And The 12th Man', 2, 9, 'Yes', 'Yes', 'No', 22, 8, 2003, 'Faced with a string of nine brutal murders, all with different MOs and no apparent similarities among the victims, Captain Stottlemeyer calls in Monk to help him investigate. Suspicion falls at first on Henry Smalls, an insurance agent whose calendars appear in three of the victims\' photographs. But as Monk, accompanied by Sharona and her new boyfriend, Deputy Mayor Kenny Shale, waits in the dark for Smalls to return home, he helplessly witnesses a fatal stabbing in which the suspect becomes the victim. Rushing after the murderer, who is wearing a ski mask, Monk tries futilely to subdue him, but all he\'s able to discover is that the murderer bites his fingernails. As the number of victims rises to eleven, the diversity of the victims, combined with the fact that they all live in Marin County, suddenly causes both Monk and Stottlemeyer to realize that they\'re all members of a jury. The ensuing investigation leads them to a six-year-old personal injury case, won by the plaintiff, who is', 'Y', 'N', 8.1),
	('Monk', 'Mr. Monk And The Paperboy', 2, 10, 'Yes', 'Yes', 'No', 16, 1, 2004, 'When his paperboy, Nestor Alverez, is murdered on his front doorstep by a newspaper thief, Monk searches the newspaper for clues, all the while assuming that the murderer is really after him. Meanwhile, he has to put up with policemen examining every inch of his apartment, which is now a crime scene, and wiping their feet on his clean doormat. Worse, his nerdy upstairs neighbor, Kevin, can\'t stop talking about his affair with a pretty woman who suddenly finds him irresistible. The search through the newspaper leads Monk to solve two unrelated crimes, including one in France, but takes him no nearer to solving Nestor\'s murder until a second murder is committed near his home. This time it\'s a convenience store clerk killed with a broken soft drink bottle near an ATM. A sharp-eyed Sharona spots a smudge of lipstick on the bottle, leading them to suspect that this time the killer is a woman. As Monk, returning to the paper one last time, tosses it in the trash in frustration, he sees the', 'Y', 'N', 8.2),
	('Monk', 'Mr. Monk And The Three Pies', 2, 11, 'Yes', 'Yes', 'No', 23, 1, 2004, 'When Monk\'s older brother Ambrose calls him about a \'\'life-or-death matter,\'\' Monk accepts the call grudgingly and agrees to meet the brother from whom he\'s been estranged since Ambrose refused to attend Trudy\'s funeral seven years before. In fact, Ambrose, an agoraphobic packrat whose house is full of bundled up newspapers, has not left the home he and Adrian grew up in for thirty-two years. Believing Ambrose\'s claim that his next-door neighbor, Pat Van Ranken, has murdered his wife after a loud argument, Monk and Sharona visit Van Ranken and decide to follow him. Van Ranken, meanwhile, is behaving very strangely, entering a potato sack race and a bingo tournament in which the prizes include a cherry pie. It\'s not hard for the Monk brothers to tie Van Ranken to another murder involving a cherry pie--the challenge is finding a motive for Van Ranken and proving that he did it. The episode provides a glimpse of Monk\'s family background and the reasons for his estrangement from his brother,', 'Y', 'N', 8.7),
	('Monk', 'Mr. Monk And The T.V. Star', 2, 12, 'Yes', 'Yes', 'No', 30, 1, 2004, 'After visiting the set of the hit TV series Crime Lab S.F. during a celebration of its one hundredth episode, Monk suspects the show\'s star, Brad Terry, of murdering his ex-wife so he won\'t have to share his huge new paychecks with her. But the actor\'s alibi seems solid--he was with photographers when the victim\'s screams were heard. To complicate matters, a fan confesses to the crime and Terry passes a lie detector test. After Terry invites the captain, Disher, and Sharona--but not Monk--to a party, Monk realizes that Terry reminds him of a popular boy who treated him the same way in sixth grade and begins to doubt his own instincts. But when Stottlemeyer invites Monk to hear Marci\'s confession, Monk\'s doubts shift to Marci\'s story. When she tells him that Terry\'s ex-wife was once an actress who made a single B movie, Monk has the clue he needs to solve the crime.', 'Y', 'N', 8.4),
	('Monk', 'Mr. Monk And The Missing Granny', 2, 13, 'Yes', 'Yes', 'No', 6, 2, 2004, 'Unable to pay for Monk\'s services as a private detective, middle-aged law student Julie Parlo offers him a trade--she\'ll help Monk become reinstated as a policeman with the SFPD if he\'ll help her find her missing grandmother. The only clue to the identity of the kidnappers is a roughly drawn lightning bolt on a note left at the grandmother\'s house, leading Stottlemeyer and Disher to suspect the former leader of an anti-Vietnam War group from the Seventies. But when the captain, anticipating Monk\'s reinstatement, invites Monk to help him with interrogation, Monk accidentally discovers that the suspect\'s tattoo doesn\'t match the symbol on the note--it has three humps instead of two. Meanwhile, the kidnappers order Julie to provide turkey dinners to the homeless in exchange for the return of the grandmother. Julie complies and her grandmother is returned safely, leading Stottlemeyer to put the case \'\'on the back burner.\'\' True to her promise, Julie informs Monk of a loophole that will all', 'Y', 'N', 7.9),
	('Monk', 'Mr. Monk And The Captain\'s Wife', 2, 14, 'Yes', 'Yes', 'No', 13, 2, 2004, 'On her way to film a documentary (apparently about a union dispute), Captain Stottlemeyer\'s wife, Karen, is badly injured when her car is struck by a tow truck whose nonunion driver has been killed by a sniper. Distraught and furious, the captain blames a sleazy union official and his thug, a theory that seems to be confirmed when a second tow truck driver is murdered. But Lieutenant Disher, in charge of the crime scene investigation, discovers an odd detail that doesn\'t fit well with this scenario--both the assailant and the murdered truck driver were barefoot. Empathizing with the captain\'s anguish, Monk offers to do whatever he can to help and of course ends up investigating the case. A small dog that follows Sharona from the crime scene leads her to the home of a handsome man who seems attracted to her, but Monk is more interested in the next-door neighbor\'s off-kilter sundial. Meanwhile, the captain, fearing that his wife will die, becomes increasingly violent, taking out his ange', 'Y', 'N', 8.3),
	('Monk', 'Mr. Monk Gets Married', 2, 15, 'Yes', 'Yes', 'No', 27, 2, 2004, 'After a phone call from Lt. Disher, Monk and Sharona find him in Captain Stottlemeyer\'s office, drinking Scotch to console himself because his 58-year-old mother has married a 37-year-old antique dealer he\'s sure is up to no good. The con man, Dalton Padron, has taken his aging bride to a marriage counseling clinic for their honeymoon, and Sharona persuades Monk that the best way to catch him is to pose as husband and wife and join him at the clinic. In a group therapy session, Sharona accuses Padron of winking at her and, in the scuffle that follows, snatches an old letter from his jacket pocket. The letter confirms their suspicions: Padron is after the gold that was stashed away 150 years earlier by the crazy old prospector who once owned the house. Padron later grabs the letter and burns it, but not before Monk and Sharona discover that the secret is somewhere in the hundreds of journals that the old man wrote before he died. Early the next morning, Sharona follows Padron into an ol', 'Y', 'N', 8.2),
	('Monk', 'Mr. Monk Goes To Jail', 2, 16, 'Yes', 'Yes', 'No', 5, 3, 2004, 'Who would murder a death-row inmate forty-five minutes before his execution--and why? That\'s the question Captain Stottlemeyer asks Monk--but Monk\'s response is to ask why it matters. As Monk is hurrying to leave the prison, however, he gets a phone call from his old nemesis, Dale \'\'the Whale\'\' Biederbeck, that changes his plans. The police consider Dale a suspect in the inmate\'s murder (the young man owed him twelve hundred dollars) and refuse to give him a window in his cell until his name is cleared, so Dale strikes a bargain with Monk--solve the case and he\'ll provide information about Trudy\'s murder. After interviewing the cook who prepared the dead inmate\'s last meal, Monk notices that another cook never clocked out the evening before. The missing cook is found dead in a freezer with a wad of bills in his apron pocket--clearly the person who bribed him to poison the inmate was afraid he would talk and killed him, too. On his way out of the prison, he receives another phone call, th', 'Y', 'N', 8.5),
	('Monk', 'Mr. Monk Takes Manhattan', 3, 1, 'Yes', 'Yes', 'No', 18, 6, 2004, 'Monk and his friends go to New York City to discover the connection between Trudy\'s murder and Warrick Tennyson, whose name was given to Monk by Dale the Whale in last season\'s cliffhanger, \'\'Mr. Monk Goes to Jail.\'\' As they\'re checking into their hotel, mayhem breaks out in the lobby and three people are killed, including the Latvian ambassador to the United Nations. Monk quickly discovers that the ambassador\'s coat is wet--an odd detail because minutes earlier he was standing near Monk in a dry coat. Monk provides a police sketch artist with minute details about the perpetrator\'s left ear--the only part of his face that wasn\'t covered--and Stottlemeyer pressures the New York police captain to allow them access to Tennyson in exchange for their help in the new case. However, the DA, for reasons of her own, is blocking their access to Tennyson, and only after Stottlemeyer \'\'borrows\'\' the keys to the captain\'s office and pulls out the file that he saw Captain Cage hurriedly stuff into the b', 'Y', 'N', 8.3),
	('Monk', 'Mr. Monk And The Panic Room', 3, 2, 'Yes', 'Yes', 'No', 25, 6, 2004, 'In yet another case of murder in a room locked from the inside, a music producer is found dead with bullets in his back, head. and chest, clearly neither an accident nor a suicide. But this time there\'s a further twist: the dead man\'s pet chimpanzee, Darwin, is caught with the murder weapon in his hand. Not wanting to make a monkey of himself by falsely accusing a chimpanzee of murder, Stottlemeyer takes the chimp into the interrogation room, tempting the animal to fire what he thinks is an empty gun. Meanwhile, Disher realizes that he\'s inadvertently given the captain a loaded gun and panic ensues. When the gun goes off, endangering not only Stottlemeyer but Disher, Monk, and Sharona as well, Stottlemeyer is persuaded that the chimp is guilty and is ready to allow animal control to put him to sleep. Sharona, however, is convinced that Darwin is innocent. In desperation, Sharona resorts to breaking and entering to rescue Darwin, persuading the most unlikely person imaginable to take hi', 'Y', 'N', 8.1),
	('Monk', 'Mr. Monk And The Blackout', 3, 3, 'Yes', 'Yes', 'No', 9, 7, 2004, 'Three deaths during a city-wide blackout result in a joint investigation by Stottlemeyer, Monk, Sharona, and Disher, with the unprecedented cooperation of the FBI and the help of power company spokeswoman Michelle Rivas, an attractive brunette who is inexplicably attracted to Monk. While Sharona and Dr. Kroger pressure Monk to call Michelle, Disher follows up on Monk\'s suggestion that the power outage is connected to a \'90s radical named Winston Brenner. Everything fits--the handwriting in the note, the phrasing, even a pair of photographs. Everything except one small detail at the end of the report--Brenner died in 1995. When the FBI acknowledges the possibility that Brenner may have faked his own death to avoid a trial, Captain Stottlemeyer presents a tree-hugging former friend of Brenner\'s with the evidence that Brenner is still alive and reminds him that this particular power outage is also a homicide. When the tree-hugger is murdered, it becomes clear that the killer is indeed Bre', 'Y', 'N', 8.1),
	('Monk', 'Mr. Monk Gets Fired', 3, 4, 'Yes', 'Yes', 'No', 16, 7, 2004, 'Karen Stottlemeyer has decided to film a \'\'cinema verite\'\' documentary about her husband\'s work, but her timing couldn\'t be worse. The police commissioner shouts at the captain (on camera) for focusing on a routine arson fire in a wig factory and relying on Monk to solve a more newsworthy case involving a female victim whose body was cut up with a chainsaw. Monk is in even worse trouble. After presenting some useful leads involving the chainsaw victim\'s age and nationality, he accidentally erases several years\' worth of crucial computer files, and the enraged commissioner revokes Monk\'s private practice license despite Stottlemeyer\'s protests that doing so will destroy him. With Sharona forced to return to her old job as a nurse, the devastated Monk sits in the hospital hallway all day waiting for her until, at her exasperrated insistence, he finds a job with a magazine as a fact checker. Meanwhile, having identified the victim based on Monk\'s information, the captain and Disher zero i', 'Y', 'N', 8.5),
	('Monk', 'Mr. Monk Meets The Godfather', 3, 5, 'Yes', 'Yes', 'No', 23, 7, 2004, 'When five members of the West Coast Mafia are shot down in a barbershop, Monk is pressured by mob godfather Salvatore Lucarelli and his nephew \'\'Fat Tony\'\' to solve the case. But the FBI in the person of Agent Colmes is pressuring him, too. Despite Captain Stottlemeyer\'s insistence that Colmes is not to be trusted, Monk accepts his offer of reinstatement on the police force if he can bring down the whole gang. The only clues are a partially completed crossword puzzle and a gumball machine that was apparently used to break a back window so the killer could escape. With a Mafia bodyguard named Vince as their \'\'babysitter,\'\' Monk and Sharona interview the sole witness, Phil Bedard, a young U.S. mint employee who tells them that he saw three men running from the scene, one of them wearing a jacket with a strange-looking number 15 on the back. Bedard also explains the heightened security at the mint: someone has stolen five double-headed pennies. Associating the numbers on the jackets with a Ch', 'Y', 'N', 8.1),
	('Monk', 'Mr. Monk And The Girl Who Cried Wolf', 3, 6, 'Yes', 'Yes', 'No', 30, 7, 2004, 'It\'s Sharona\'s turn to be terrified. After several frightening and mysterious encounters with a blood-soaked man that no one else can see, she begins to doubt her own sanity, and Stottlemeyer advises Monk to give her time off to restore her nerves. Monk is left with an irritating substitute nurse whose philosophy is the opposite of Sharona\'s: everything from Monk\'s requests for wipes to the obsessively systematic organization of his refrigerator has to go. Wanting Sharona back again, Monk goes to the garage where Sharona first saw the blood-soaked man and finds a clue--the silver tip from the toe of a cowboy boot. Meanwhile Sharona, who is attending a night class in creative writing, apparently forgets to turn in an assignment and seems to be misplacing objects. But when her writing instructor\'s husband dies of a heart attack after eating tomato soup, Sharona recognizes the plot of her missing story and realizes that she\'s not crazy. All she and Monk have to do now is tie together the', 'Y', 'N', 8.3),
	('Monk', 'Mr. Monk And The Employee Of The Month', 3, 7, 'Yes', 'Yes', 'No', 6, 8, 2004, 'When Edna Coruthers, a model employee at a giant chain store called Mega-Mart, is killed by a falling television set, Monk is called in to investigate by the store\'s security chief--who turns out to be his disgraced ex-partner, Joe Christie. Neither Monk nor Stottlemeyer wants to work with Christie, whom they hold responsible for some missing cocaine and the death of two police officers, and both of them disregard the evidence that Edna might have been murdered--a broken shoe heel (suggesting that the victim ran from someone or something), her dust allergy (which normally kept her from entering the loading dock where the death occurred), and the three letters (in different handwriting but with similar stamps) complaining about the victim. Twenty-seven days later, realizing that the stamps were all from the same roll and therefore from the same person, Monk reluctantly agrees to help Christie discover a suspect and a motive by working undercover as a store clerk. But he still doesn\'t tr', 'Y', 'N', 8.5),
	('Monk', 'Mr. Monk And The Game Show', 3, 8, 'Yes', 'Yes', 'No', 13, 8, 2004, 'With Sharona in New Jersey to visit her ailing mother, Monk is left in the very incompetent hands of his annoying upstairs neighbor, Kevin Dorfman, but the prospect of a week with Kevin is eased somewhat by a visit from Trudy\'s father, Dwight Ellison. Dwight invites Monk (and Kevin) to spend the week with him and his wife, Marcia--and at the same time investigate gameshow host Roddy Lankman, who appears to be involved in a conspiracy to allow one of his contestants, Val Birch, to win every game. Despite the memories of Trudy aroused by spending time with her parents in her former home and the questionable help of Kevin, Monk discovers evidence that Lankman visited Birch\'s house--and that Birch visited the site of the accident that killed Lankman\'s assistant, Lizzie Talvo. To discover exactly how Lankman and his crooked contestant are communicating--and possibly prove that they\'re involved in something much worse than cheating--Monk becomes a contestant on the game show. His knowledge o', 'Y', 'N', 8.6),
	('Monk', 'Mr. Monk Takes His Medicine', 3, 9, 'Yes', 'Yes', 'No', 20, 8, 2004, 'After Captain Stottlemeyer is shot in the shoulder by an unknown assailant, a somewhat rattled and very angry Disher is left in charge of the investigation. Although Monk is almost as distressed as Disher, he provides very little help with the investigation, even allowing a suspect to get away. Feeling depressed and helpless, Monk decides to try a new medication that controls his OCD and eliminates his phobias but also makes him insufferably egotistical, unempathetic, and oblivious to the details that are so vivid to the \'\'normal\'\' Monk. Meanwhile, the suspect Disher has been pursuing is proven innocent, and the bullet taken from the captain\'s shoulder is traced to a gun belonging to a dead woman. Stottlemeyer impatiently checks himself out of the hospital with his arm in a sling and arranges to interview the new suspect with the help of Monk, Sharona, and Disher. Monk arrives late, dressed in a loud Hawaiian shirt and talking like a \'\'cool cat\'\' from the 1950s. \'\'The Monk,\'\' as he calls him', 'Y', 'N', 8.3),
	('Monk', 'Mr. Monk And The Red Herring', 3, 10, 'Yes', 'Yes', 'No', 21, 1, 2005, 'With Sharona in New Jersey remarried to her ex-husband, Monk has been without an assistant for three months and it\'s time to find a new one--if only he could find a suitable applicant. When Natalie Teeger, a thirty-something widow with an eleven-year-old daughter, arrives at his house, he thinks she\'s applying for the job, but she\'s really been sent by Captain Stottlemeyer to get Monk\'s help--two men have broken into her apartment in the last few days and she had to kill the second one with scissors in self-defense. Examining Natalie\'s apartment, Monk finds a single clue, an unused fish net caught between the sofa cushions, suggesting that the intruders were trying to steal Mr. Henry, Julie\'s pet fish. But why would anyone want to steal a ninety-nine-cent red herring, er, crimson marblefish? A second clue surfaces when Lieutenant Disher finds a note in the dead perp\'s pocket reading \'\'2:30 Sea of Tranquility\'\' and Natalie identifies the Sea of Tranquility as an exhibit at the science mus', 'Y', 'N', 8.7),
	('Monk', 'Mr. Monk Vs The Cobra', 3, 11, 'Yes', 'Yes', 'No', 28, 1, 2005, 'When John Ricca, author of a controversial and unfavorable biography of martial artist Sonny (\'\'the Cobra\'\') Chow, is found dead in his home, all the evidence points to Chow as the murderer. Unfortunately for Captain Stottlemeyer, his chief suspect has been dead for six years. While Monk and Natalie (who\'s more interested in being reimbursed for her business expenses than in solving the case) visit Chow\'s former teacher, Master Zee, who claims that Chow died in his arms, Stottlemeyer resorts to having the corpse dug up to prove that, despite rumors to the contrary, Chow is indeed dead. A dental X-ray proving that the corpse is Chow leaves Monk to figure out who tried to frame the dead man for murder. On an inadvertent tip from Disher, an avid Cobra fan, Monk and Natalie visit the Sonny Chow museum, where Monk finds two important clues--a hairbrush that has been stolen from its case and replaced with a lookalike and the stamp that the museum proprietor placed on Natalie\'s hand so that she', 'Y', 'N', 8.4),
	('Monk', 'Mr. Monk Gets Cabin Fever', 3, 12, 'Yes', 'Yes', 'No', 4, 2, 2005, 'After witnessing a Chinese gangland murder, Monk has to stay in an FBI safe house--a cabin in the woods--in the protective custody of Agent Grooms, with Stottlemeyer and Natalie as company. Awakened by a man\'s scream, Monk convinces Stottlemeyer and Natalie that a woman in a nearby cabin has murdered her husband. Agent Grooms, however, remains skeptical. After Grooms disconnects their telephone, Stottlemeyer locks him in the bathroom and the three \'\'borrow\'\' Grooms\'s car and set out in a rainstorm to investigate, only to get stuck in the mud on the way. Meanwhile, Disher and his new girlfriend Hayley are encountering a strange circumstance--the fortunes in their fortune cookies keep coming true. When a fortune informs Disher that an old friend is in trouble and only he can save him, Disher immediately sets out to save Monk, unaware that he\'s leading a pair of hitmen to the FBI cabin. After a rainy night in the car, Stottlemeyer leads Natalie and Monk through the woods toward the neighbor', 'Y', 'N', 8.5),
	('Monk', 'Mr. Monk Gets Stuck In Traffic', 3, 13, 'Yes', 'Yes', 'No', 11, 2, 2005, 'When Monk, Natalie, and Julie get stuck in a traffic jam after a multi-car collision blocks the freeway, Monk gets out of the car to investigate. He soon deduces from the absence of skid marks and other clues that the young man in the overturned Volkswagen that caused the pile-up was murdered and his body placed in the car to make his death look like an accident. But the highway patrolman in charge of the \'\'accident\'\' scene wants nothing to do with Monk (or the not-very-successful lawyer who has latched onto him), and the mountains blocking the signal prevent Monk from calling Captain Stottlemeyer for an authorization to investigate. Monk briefly returns to Natalie\'s car, where he finds Julie in need of a bathroom and Natalie nursing an injured wrist. Unfortunately for them, Monk\'s mind is on the fatality, and he returns to the Volkswagen. The angry officer gives him the victim\'s name and occupation (environmental activist), but he still refuses to listen to Monk\'s evidence. Meanwhile, t', 'Y', 'N', 8.5),
	('Monk', 'Mr. Monk Goes To Vegas', 3, 14, 'Yes', 'Yes', 'No', 18, 2, 2005, 'In the middle of the night, Monk receives a phone call from a drunken Stottlemeyer, who has gone to Las Vegas with Disher for a fellow officer\'s bachelor party. Stottlemeyer believes that a wealthy casino owner has murdered his wife, but he needs Monk\'s help to prove that the death wasn\'t an accident. Unfortunately, when Monk arrives in Vegas with Natalie the next morning, Stottlemeyer can\'t remember anything that happened the previous night--including how his pants happened to be thrown out the window. As Monk and Natalie explore the elevator where the woman died, interrogate witnesses, and reenact the death scene (with Monk in the role of victim), Stottlemeyer tries to retrace his steps and deal with Disher, who has become addicted to blackjack and fallen hopelessly deep into debt. When Monk, at Stottlemeyer\'s insistence, takes Disher\'s place at the blackjack table to win back his money, he figures out how the murder occurred as he simultaneously places winning bets, but the casino o', 'Y', 'N', 8.4),
	('Monk', 'Mr. Monk And The Election', 3, 15, 'Yes', 'Yes', 'No', 25, 2, 2005, 'With her daughter\'s school about to be closed as a cost-cutting measure, Natalie becomes a candidate in the upcoming school board election despite Monk\'s fears that she\'ll desert him if she wins. Natalie\'s frustrations with a jammed photocopier and other defective equipment bought at a police auction are dwarfed by fear for her life when a sniper fires into her campaign headquarters, further damaging the equipment and killing a security guard. The only clues to the identity of the sniper are an oddly folded note demanding that \'\'Natalie Teege\'\' withdraw from the election and a bullet from a semiautomatic rifle made in Russia. Suspicion falls on Natalie\'s opponent in the election, Harold Krenshaw, whom Monk knows as a fellow patient of Dr. Kroger\'s. Although Monk thinks that Krenshaw is lying about his friendship with Dr. Kroger and Krenshaw admits to being an excellent shot, Monk is sure that Krenshaw is innocent because he wouldn\'t misspell Natalie\'s name. When Krenshaw passes a polygra', 'Y', 'N', 8),
	('Monk', 'Mr. Monk And The Kid', 3, 16, 'Yes', 'Yes', 'No', 4, 3, 2005, 'After twenty-two-month-old Tommy Graser finds a severed finger and gives it to a policeman, Monk walks through the park with Tommy trying to retrace the child\'s steps. He finds no body or other incriminating evidence, but he does discover a surprising affection for the placid and intelligent toddler, who constantly repeats Monk\'s name and quietly submits to having his hands wiped when he touches \'\'nature.\'\' A lab technician identifies the finger as that of a twenty-five-year-old man, and Monk deduces from a callus that the young man played the violin. After visiting the home of Daniel Carlyle, a musician who fits this description, Monk concludes that Daniel\'s mother and her other son, Jason, killed Daniel and that Jason is masquerading as his brother. Meanwhile, little Tommy is temporarily removed from the custody of his foster parents, and Monk surprises everyone, including himself, by volunteering to care for him for two weeks until his new adoptive parents can take him. With Tommy in', 'Y', 'N', 9),
	('Monk', 'Mr. Monk And The Other Detective', 4, 1, 'Yes', 'Yes', 'No', 8, 7, 2005, 'While Monk is immobilized by the presence of dog poo at a crime scene, slovenly private eye Marty Eels steps in, using the dog poo (and the dog) as clues in the murder of a security guard, the robbery of a jewelry store, and the disappearance of the store owner, Harold Gumbal. With Monk tailing helplessly behind, muttering \'\'He\'s cheating\'\' and \'\'That\'s impossible,\'\' Eels locates the stolen jewels, Gumbal\'s car, and Gumbal\'s body. Using Gumbal\'s watch as a clue, he determines the identity of one of the killers, who is then arrested and interrogated. Just as Eels is becoming a local celebrity, with Monk as \'\'yesterday\'s news,\'\' Monk figures out Eels\' secret and confronts him. Eels challenges him to prove it, but moments later, he runs after Monk begging for his help: the killer who\'s still at large wants the jewels back and is holding Eels\' mother hostage. The shoe is on the other foot, and Monk must figure out where Mrs. Eels is and why she must be rescued before 8:20.', 'Y', 'N', 8.4),
	('Monk', 'Mr. Monk Goes Home Again', 4, 2, 'Yes', 'Yes', 'No', 15, 7, 2005, 'Monk is reunited with his agoraphobic brother, Ambrose, after the murder of an armored car driver.', 'Y', 'N', 8.7),
	('Monk', 'Mr. Monk Stays In Bed', 4, 3, 'Yes', 'Yes', 'No', 22, 7, 2005, 'Monk feels too sick to work until a case gets him out of bed.', 'Y', 'N', 8.2),
	('Monk', 'Mr. Monk Goes To The Office', 4, 4, 'Yes', 'Yes', 'No', 29, 7, 2005, 'Monk goes undercover as an office worker to solve a case.', 'Y', 'N', 8.6),
	('Monk', 'Mr. Monk Gets Drunk', 4, 5, 'Yes', 'Yes', 'No', 5, 8, 2005, 'Monk goes to a wine-tasting and finds it a bit more than he bargained for.', 'Y', 'N', 8.4),
	('Monk', 'Mr. Monk And Mrs. Monk', 4, 6, 'Yes', 'Yes', 'No', 12, 8, 2005, 'Is Monk hallucinating or is he really seeing Trudy?', 'Y', 'N', 8.5),
	('Monk', 'Mr. Monk Goes To A Wedding', 4, 7, 'Yes', 'Yes', 'No', 19, 8, 2005, 'Needing a date for her brother\'s rehearsal dinner, Natalie resorts to asking Lt. Disher. ', 'Y', 'N', 8.5),
	('Monk', 'Mr. Monk And Little Monk', 4, 8, 'Yes', 'Yes', 'No', 26, 8, 2005, 'Monk flashes back to his early teenage years.', 'Y', 'N', 8.1),
	('Monk', 'Mr. Monk And The Secret Santa', 4, 9, 'Yes', 'Yes', 'No', 2, 12, 2005, 'When an officer dies after drinking poisoned wine sent to Captain Stottlemeyer as a Christmas gift, the captain suspects Frank Prager, who tried to shoot him outside a bar several months earlier. Searching the crime scene for clues, Monk notes that the bullet holes seem to form a pattern, but neither he nor Stottlemeyer can figure out the message they\'re intended to convey. After trying unsuccessfully to talk with Prager\'s young daughter, Monk goes under cover as Santa Claus. This time he learns that Prager is hiding in a church with \'\'three ladies\'\' in front of it. But when Prager is caught and interrogated, it\'s clear that he had nothing to do with the poisoned wine. With the other suspects on Disher\'s list also eliminated, Monk and the captain are back to square one. But when Monk opens the card accompanying his gift from the Christmas party, he finds the clue that solves the case.', 'Y', 'N', 8.2),
	('Monk', 'Mr. Monk Goes To A Fashion Show', 4, 10, 'Yes', 'Yes', 'No', 13, 1, 2006, 'Monk is facing a crisis: he\'s down to five shirts. But Inspector No. 8, the only shirt inspector who can meet Monk\'s criteria for perfection, is not up to her usual standards. Sensing that something is wrong, Monk visits No. 8 on the job. The inspector, Maria Ortiz, informs him that her son, Pablo, has been imprisoned for murdering a fashion model, but she\'s certain that he\'s innnocent. Monk is chiefly concerned about his shirts, but Natalie persuades him to talk to Pablo because \'\'it\'s the right thing to do.\'\' The conversation uncovers just one clue: Pablo can\'t read English. When Monk realizes that the killer must have been able to read an emergency exit sign, he\'s convinced that Pablo is innocent despite the DNA evidence used to convict him. With Stottlemeyer and Disher in tow, Monk and Natalie attempt to talk to the model\'s former roommate and the fashion designer she worked for, Julian Hodge. But now there\'s a new problem: Hodge wants thirteen-year-old Julie to model for him. Watching the rehearsal for a fashion show in which Julie will make her debut, Monk discovers a clue that points him to the real killer. When another supermodel is found dead, it\'s imperative that Monk find new evidence to prove his suspect guilty of both murders and set Pablo free--and for Natalie to get Julie away from the person committing the murders.', 'Y', 'N', 8),
	('Monk', 'Mr. Monk Bumps His Head', 4, 11, 'Yes', 'Yes', 'No', 20, 1, 2006, 'Suffering from amnesia, Monk wakes up believing he is the husband of an eccentric resident of a small town.', 'Y', 'N', 8.5),
	('Monk', 'Mr. Monk And The Captain\'s Marriage', 4, 12, 'Yes', 'Yes', 'No', 27, 1, 2006, 'During the investigation of a murder in a junkyard, Captain Stottlemeyer punches a cop named Ryan Sharkey, who claims to be having an affair with the captain\'s wife, Karen. The only witness to the murder, a homeless man named Gerald or Jerry, has disappeared, but Stottlemeyer suspects businessman Michael Karpov, who is facing charges for money laundering and had a motive for killing the victim, who was scheduled to testify against him. Removed from the case and ordered to take anger management classes, Stottlemeyer asks Monk and Natalie to follow his wife, whom he suspects of lying about her whereabouts. They discover Karen having lunch with a man but are only able to photograph him from the back before being interrupted. Meanwhile, the homeless witness has been stunned and thrown from the third floor of a building but survives the fall, thanks to a corrugated refrigerator carton. Disher places Karpov in a line-up otherwise composed of police officers, including Sharkey, but Stottlemeyer, still enraged at Sharkey, disrupts the line-up before the procedure has been completed. An apple provides the clue that Monk needs to solve the murder case, and Karen reveals the identity of the mystery man she had lunch with. Unfortunately for the captain, it isn\'t Sharkey.', 'Y', 'N', 8.1),
	('Monk', 'Mr. Monk And The Big Reward', 4, 13, 'Yes', 'Yes', 'No', 3, 2, 2006, 'Low on cash because they haven\'t had a homicide to investigate in three weeks, Monk and Natalie search for the stolen Alexander Diamond, hoping to win the million-dollar reward. Unfortunately, they have competition in the form of a retired Scotland Yard investigator, a bounty hunter, and a gadget-loving private detective, all of whom want the reward money for themselves. Monk quickly figures out that the heist was an inside job and that one of the robbers was under five feet tall, short enough to hide inside a roll-top desk. He also discovers a clue linking a perpetrator to a transcendental meditation retreat. With their competitors close behind them, Monk and Natalie head for the retreat, where they find the thief, who is unfortunately dead. Meanwhile, Disher is having to interrogate a strange young woman who keeps turning herself in for such \'\'crimes\'\' as stealing pens or murdering a hamster. Monk tells Natalie that he\'s solved the case and they race to the police station with the other detectives following. The only thing left is to find the diamond before their competitors do.', 'Y', 'N', 7.9),
	('Monk', 'Mr. Monk And The Astronaut', 4, 14, 'Yes', 'Yes', 'No', 3, 3, 2006, 'When Captain Stottlemeyer suspects that a suicide is really a murder, Monk confirms his suspicions by discovering that the victim, Joanne Raphelson, was too short to have used the stool she supposedly stood on to hang herself. But the next clue, the remains of an olive, a cherry, and a cocktail onion on a stirring stick, leads Monk to suspect that the murder was committed by an astronaut, Steve Wagner. A little research reveals a motive--Joanne was about to publish a book revealing that Wagner had abused her five years earlier. Now all Monk has to do is to prove that Wagner could commit the murder when he was in outer space.', 'Y', 'N', 8.4),
	('Monk', 'Mr. Monk Goes To The Dentist', 4, 15, 'Yes', 'Yes', 'No', 10, 3, 2006, 'During the investigation of an armored car heist involving the deaths of two drivers and the theft of valuable government bonds, Lt. Disher tries to convince Captain Stottlemeyer that he witnessed a murder while under anesthesia in the dentist\'s office. When one of the highjackers, Denny Jardeen, is found murdered, Disher insists that Jardeen is the man he saw Dr. Bloom and his assistant kill while he was sedated. Stottlemeyer still thinks that Disher was hallucinating, and Disher angrily leaves the force, deciding to revive his high school rock band, the Randy Disher Project, as an alternate means of earning his living. Meanwhile, the only clue to Jardeen\'s murder is two pairs of bruises each ten inches apart on the dead man\'s chest.', 'Y', 'N', 8.4),
	('Monk', 'Mr. Monk Gets Jury Duty', 4, 16, 'Yes', 'Yes', 'No', 17, 3, 2006, 'Monk is summoned to jury duty against his wishes and must solve two crimes: he has to convince the jury the defendent is not guilty, and solve the mystery of a corpse outside the jury room\'s window.', 'Y', 'N', 9),
