	('Mr Bean', 'The Curse Of Mr Bean', 1, 3, 'Yes', 'Yes', 'NA', 30, 12, 1990, 'Mr. Bean goes to a swimming pool, where he finds himself scared to death on the high diving board. When he\'s done, he tries several different ways to get his car out of the parking garage when he doesn\'t have enough money to do it the normal way. After that, he sits on a park bench and uses an unusual method of making himself a sandwich. Finally, he goes to a movie theater and tries to survive a terrifying horror with his girlfriend.', 'Y', 'N', 8.9),
	('Mr Bean', 'Mr Bean Goes To Town', 1, 4, 'Yes', 'Yes', 'NA', 15, 10, 1991, 'Mr Bean purchases a new TV, only to experience a spot of reception trouble. He then takes a stroll in the park to try out his new camera, which is promptly stolen. This leads to an identity parade, where Bean does his best to discover the identity of the camera thief. Later, Bean\'s night on the town spells disaster for a stage magician. Lastly, Mr Bean shows of his dancing skills at Club Phut.', 'Y', 'N', 8.5),
	('Mr Bean', 'The Trouble With Mr Bean', 1, 5, 'Yes', 'Yes', 'NA', 1, 1, 1992, 'Mr Bean, late for his dental appointment, tries to get dressed and clean his teeth whilst on the way. After arriving just in time for the appointment, he ends up administering an anesthetic to the hapless dentist. After visiting the dentist, Bean has a picnic in the park, where he tangles with a pesky fly and a remote-control toy boat.', 'Y', 'N', 8.7),
	('Mr Bean', 'Mr Bean Rides Again', 1, 6, 'Yes', 'Yes', 'NA', 17, 2, 1992, 'At the bus stop, Mr Bean tries his best to revive a heart attack victim before using an ambulance to jump-start his own mini-car. Later, when posting a letter, he loses his only stamp, but that doesn\'t stop him from sending his letter on its way. Whilst preparing for his holiday, Mr Bean demonstrates a novel (if not entirely efficient) method of packing, then disposes of a bothersome train passenger, and tries to entertain an airsick boy during a plane flight.', 'Y', 'N', 8.6),
