	('Mr Bean', 'Do-It-Yourself Mr Bean', 1, 10, 'Yes', 'Yes', 'NA', 25, 4, 1994, 'Mr. Bean spends a rather unusual day at a Funfair attraction with a rather unusual baby which he accidentally found. Mr. Bean tries to find ways to keep the baby occupied while he goes on his rides. In the end, the baby is returned to its mother and Mr. Bean calls it a day.', 'Y', 'N', 8.5),
	('Mr Bean', 'Back To School Mr Bean', 1, 11, 'Yes', 'Yes', 'NA', 26, 10, 1994, 'Mr. Bean goes back to school for an orientation day while he sees the different projects and activities in which he gets into mischief.', 'Y', 'N', 8.6),
	('Mr Bean', 'Tee Off, Mr Bean', 1, 12, 'Yes', 'Yes', 'NA', 20, 9, 1995, 'Mr. Bean goes to a laundromat where he washes his clothes and other various items and ends up causing trouble with the other people and their laundry. Afterwards, he heads off to a mini golf course where he plays but ends up following the ball everywhere it goes and continues to play even when it\'s not on the course.', 'Y', 'N', 8.5),
	('Mr Bean', 'Goodnight Mr Bean', 1, 13, 'Yes', 'Yes', 'NA', 31, 10, 1995, 'Mr. Bean goes to the hospital to have a tea kettle removed from his hand, and while trying to get in faster ends up with him getting in much later. Afterwards, he decorates a British guard so that he can take a picture. After he has insomnia, Mr. Bean finally finds the solution and falls asleep.', 'Y', 'N', 8.7),
	('Mr Bean', 'Hair By Mr Bean Of London', 1, 14, 'Yes', 'Yes', 'NA', 26, 8, 2006, 'When Mr. Bean has to wait a few minutes for the hairdresser who\'s called away by the telephone, he starts playing barber, so three consecutive costumers have their hair done by him, but his inverse Midastouch strikes again: woe their hair and the real hairdresser they complain to! Next he goes to a pet show, starting of by cheating at a dexterity game by unplugging the fault-detection and next deciding to play \'hit the headmaster\' not just with the provided wet sponges, but wit anything not too heavy for him to lift; then he enters his teddy-bear for the obedience test (meant for kids\' dogs). In the train station he stops at nothing to get on without a ticket, and succeeds as a crawling sack of post - but on which train is he carried?', 'Y', 'N', 8.6),
	('Mr Robot', 'Eps1.0_Hellofriend.Mov', 1, 1, 'Yes', 'Yes', 'Yes', 24, 6, 2015, 'Elliot, a cyber-security engineer by day and vigilante hacker by night, is recruited by a mysterious underground group to destroy the firm he\'s paid to protect. Elliot must decide how far he\'ll go to expose the forces he believes are running (and ruining) the world.', 'Y', 'N', 9.4),
	('Mr Robot', 'Eps1.1_Ones-And-Zer0Es.Mpeg', 1, 2, 'Yes', 'Yes', 'Yes', 1, 7, 2015, 'Elliot is torn between accepting a job offer from Evil Corp and joining the fsociety hacker group. At the same time Elliot needs to make decision that could harm people around him.', 'Y', 'N', 8.8),
	('Mr Robot', 'Eps1.2_D3Bug.Mkv', 1, 3, 'Yes', 'Yes', 'Yes', 8, 7, 2015, 'Elliot tries to lead a normal life, but can\'t escape fsociety. Gideon, meanwhile, grows suspicious, and Tyrell plays dirty.', 'Y', 'N', 8.5),
	('Mr Robot', 'Eps1.3_Da3M0Ns.Mp4', 1, 4, 'Yes', 'Yes', 'Yes', 15, 7, 2015, 'Elliot\'s inner-demons threaten an fsociety operation.', 'Y', 'N', 8.3),
	('Mr Robot', 'Eps1.4_3Xpl0Its.Wmv', 1, 5, 'Yes', 'Yes', 'Yes', 22, 7, 2015, 'Fsociety attempts to penetrate Steel Mountain, the most secure data facility in America.', 'Y', 'N', 8.7),
	('Mr Robot', 'Eps1.5_Br4Ve-Trave1Er.Asf', 1, 6, 'Yes', 'Yes', 'Yes', 29, 7, 2015, 'Elliot attempts to hack Vera out of jail in order to save someone he cares about. Meanwhile, Tyrell\'s \'game\' gets crazy and Angela digs deeper into her mother\'s death.', 'Y', 'N', 9.2),
	('Mr Robot', 'Eps1.6_V1Ew-S0Urce.Flv', 1, 7, 'Yes', 'Yes', 'Yes', 5, 8, 2015, 'Elliott goes missing, Mr. Robot tries to pull fsociety back together and Angela goes head-to-head with an old nemesis.', 'Y', 'N', 8.7),
	('Mr Robot', 'Eps1.7_Wh1Ter0Se.M4V', 1, 8, 'Yes', 'Yes', 'Yes', 12, 8, 2015, 'Allsafe is controlled, the Dark Army is ready to meet Elliot & Tyrell and Joanna\'s plan goes into effect.', 'Y', 'N', 9.5),
	('Mr Robot', 'Eps1.8_M1Rr0R1Ng.Qt', 1, 9, 'Yes', 'Yes', 'Yes', 19, 8, 2015, 'The Evil Corp hack is threatened by a mystery man from Elliot\'s past.', 'Y', 'N', 9.3),
	('Mr Robot', 'Eps1.9_Zer0-Day.Avi', 1, 10, 'Yes', 'Yes', 'Yes', 2, 9, 2015, 'Mr. Robot and Tyrell are MIA and a past hack haunts Elliot.', 'Y', 'N', 9),
	('Mr Robot', 'Eps2.0_Unm4Sk-Pt1.Tc', 2, 1, 'Yes', 'Yes', 'Yes', 13, 7, 2016, 'One month later and omfg, five/nine has changed the world; Elliot is in seclusion; Angela finds happiness at Evil Corp.; fsociety delivers a malicious payload; TANGO DOWN?', 'N', 'N', 8.5),
	('Mr Robot', 'Eps2.0_Unm4Sk-Pt2.Tc', 2, 2, 'Yes', 'Yes', 'Yes', 13, 7, 2016, 'Elliot is in seclusion, Angela finds happiness at Evil Corp., and fsociety delivers a malicious payload.', 'N', 'N', 8.6),
	('Mr Robot', 'Eps2.1_K3Rnel-Pan1C.Ksd', 2, 3, 'Yes', 'Yes', 'Yes', 20, 7, 2016, 'Elliot vows to beat Mr. Robot, but the task proves difficult. Angela gets a view behind the scenes at Evil Corp. Sh*t hits fan with fsociety.', 'N', 'N', 8.7),
	('Mr Robot', 'Eps2.2_Init_1.Asec', 2, 4, 'Yes', 'Yes', 'Yes', 27, 7, 2016, 'Elliot befriends Ray, hoping he can finally delete Mr. Robot; Dom makes a big discovery; Darlene considers whether the FBI or Dark Army are the bigger threat.', 'N', 'N', 8.6),
	('Mr Robot', 'Eps2.3_Logic-B0Mb.Hc', 2, 5, 'Yes', 'Yes', 'Yes', 3, 8, 2016, 'Elliot is unable to quit the game. Dom and the FBI travel to China to investigate five/nine. Joanna is haunted. Darlene asks Angela for help.', 'N', 'N', 9.1),
	('Mr Robot', 'Eps2.4_M4Ster-S1Ave.Aes', 2, 6, 'Yes', 'Yes', 'Yes', 10, 8, 2016, 'Mr. Robot tries to prove to Elliot that he can be useful. Darlene and Angela\'s plan does not go as expected.', 'N', 'N', 9.2),
	('Mr Robot', 'Eps2.5_H4Ndshake.Sme', 2, 7, 'Yes', 'Yes', 'Yes', 17, 8, 2016, 'Mr. Robot and Elliot try to get along. fsociety releases a holiday video to honor Uncle Sam. Darlene acts on an old desire.', 'N', 'N', 9.4),
	('Mr Robot', 'Eps2.6_Succ3Ss0R.P12', 2, 8, 'Yes', 'Yes', 'Yes', 24, 8, 2016, 'The latest fsociety leak has Dom trying her best to spin the case in the FBI\'s favor. Angela defends her career choices. Darlene makes it known that her circle of trust is shrinking.', 'N', 'N', 8.8),
	('Mr Robot', 'Eps2.7_Init_5.Fve', 2, 9, 'Yes', 'Yes', 'Yes', 31, 8, 2016, 'Angela wants more from Evil Corp.. Dark Army\'s allegiance is in question. Elliot and Darlene seek answers.', 'N', 'N', 8.9),
	('Mr Robot', 'Eps2.8_H1Dden-Pr0Cess.Axx', 2, 10, 'Yes', 'Yes', 'Yes', 7, 9, 2016, 'Elliot wonders if Mr. Robot has been lying to him. Darlene attempts to do the right thing. Dom and the FBI get closer.', 'N', 'N', 9.5),
	('Mr Robot', 'Eps2.9_Pyth0N-Pt1.P7z', 2, 11, 'Yes', 'Yes', 'Yes', 14, 9, 2016, 'Angela makes an acquaintance. Darlene realizes she is in too deep, an old friend reveals everything to Elliot.', 'N', 'N', 8.7),
	('Mr Robot', 'Eps2.9_Pyth0N-Pt2.P7z', 2, 12, 'Yes', 'Yes', 'Yes', 21, 9, 2016, 'Darlene realizes she is in too deep, an old friend reveals everything to Elliot', 'N', 'N', 9),
	('Numb3rs', 'Pilot', 1, 1, 'Yes', 'Yes', 'No', 23, 1, 2005, 'To help capture a serial rapist-turned-killer, FBI Special Agent Don Eppes recruits his genius brother Charlie, who uses a mathematical equation to identify the killer\'s point of origin by working back from the crime scene locations.', 'Y', 'N', 7.7),
	('Numb3rs', 'Uncertainty Principle', 1, 2, 'Yes', 'Yes', 'No', 28, 1, 2005, 'Charlie accurately predicts where a band of bank robbers will strike next. But when Don and his team confront them, a massive shoot-out occurs leaving four people, including an officer, dead. The outcome disturbs Charlie and he retreats into the family garage to work out an unsolvable math problem that he also plunged into after his mother became ill a year earlier. But Don needs his brother\'s help and tries to get Charlie to return to the case.', 'Y', 'N', 7.8),
	('Numb3rs', 'Vector', 1, 3, 'Yes', 'Yes', 'No', 4, 2, 2005, 'Various people in the L.A. area with seemingly nothing in common start to become extremely sick and die on the same day. Don fears bioterrorists may have released a deadly virus into the environment. While he tries to discover whether anyone is behind the outbreak, Charlie tries to locate the point of origin.', 'Y', 'N', 7.4),
	('Numb3rs', 'Structural Corruption', 1, 4, 'Yes', 'Yes', 'No', 11, 2, 2005, 'After an engineering student at CalSci is found dead from an apparent suicide, Charlie convinces Don to launch an investigation after he reads the student\'s thesis that asserted that the architecturally magnificent Cole Center in Los Angeles is structurally unstable. Although reluctant at first, Don and his FBI agents discover that the student\'s findings were correct and uncover a dangerous and surprising conspiracy. Meanwhile, Alan prepares for a first date and convinces Don and Terry to join them, hoping they might rekindle their old romance.', 'Y', 'N', 7.4),
	('Numb3rs', 'Prime Suspect', 1, 5, 'Yes', 'Yes', 'No', 18, 2, 2005, 'When a five-year-old girl is kidnapped from her birthday party, Don and Terry lead the investigation, but must rely on Charlie\'s help because the girl\'s father, Ethan, is also a mathematician. Charlie realizes the kidnapper\'s motive when Ethan reveals he is close to solving Riemann\'s Hypothesis, a difficult math problem. If solved, the solution could not only earn him $1 million, but could break the code for internet security and unlock the world\'s biggest financial secret.', 'Y', 'N', 7.7),
	('Numb3rs', 'Sabotage', 1, 6, 'Yes', 'Yes', 'No', 25, 2, 2005, 'While consulting with the NTSB at the scene of the wreck, Don learns that this tragedy is one of a series of recreated accidents involving railroad negligence. As is the pattern with the previous train wrecks, an undecipherable numerical code is left at the site, which Don recruits Charlie to solve. By breaking the code, Charlie is able to establish that this accident was a recreation of a deadly wreck that left only one survivor several years ago. Don\'s investigation leads him and his team to a dangerous standoff with their suspect, who has surprising ties to the railway system.', 'Y', 'N', 7.7),
	('Numb3rs', 'Counterfeit Reality', 1, 7, 'Yes', 'Yes', 'No', 11, 3, 2005, 'Don learns that counterfeiters are at work producing small-denomination bills, and that they have taken an artist hostage to draw the images for the fake money. If the missing woman isn\'t located soon, Don fears that she will be killed when her work is finished on the phony cash. The counterfeiters have already murdered at least five people, two of whom stole money from them. The case is made more difficult for Don when his former lover, now a Secret Service agent, is assigned to it.', 'Y', 'N', 7.9),
	('Numb3rs', 'Identity Crisis', 1, 8, 'Yes', 'Yes', 'No', 1, 4, 2005, 'A man wanted for stock fraud is found garroted in his apartment, and the crime is eerily similar to a murder committed a year earlier, a case in which Don closed when an ex-con confessed. Now, Don must re-investigate the old case to determine if he put an innocent man in jail. He asks Charlie to go over the evidence to see if he missed anything the first time around.', 'Y', 'N', 7.4),
	('Numb3rs', 'Sniper Zero', 1, 9, 'Yes', 'Yes', 'No', 15, 4, 2005, 'The city is in a panic as a sniper goes on a shooting spree and randomly kills several people, including a postal worker. The investigation reveals that more than one shooter is at work. As Charlie works the case, he\'s frustrated by a sniper expert Don brings in to help out.', 'Y', 'N', 7.7),
	('Numb3rs', 'Dirty Bomb', 1, 10, 'Yes', 'Yes', 'No', 22, 4, 2005, 'A truck carrying radioactive material is stolen, and the thieves threaten to set off a dirty bomb in L.A. in 12 hours if they aren\'t paid $20 million. While Don attempts to track down the truck, Charlie tries to come up with the most likely location where the bomb may be detonated to inflict the most damage to the population.', 'Y', 'N', 7.6),
	('Numb3rs', 'Sacrifice', 1, 11, 'Yes', 'Yes', 'No', 29, 4, 2005, 'A senior computer-science researcher working on a classified government project is found murdered in his Hollywood Hills home and data has been stolen from his computer. The investigation reveals the victim was going through a bitter divorce and was trying to keep his wife from getting his money. Charlie also learns the project on which the man was working might have involved baseball.', 'Y', 'N', 7.4),
	('Numb3rs', 'Noisy Edge', 1, 12, 'Yes', 'Yes', 'No', 6, 5, 2005, 'Don and Agent Weston of the NTSB investigate eyewitness accounts of a mysterious unidentified object flying dangerously close to downtown Los Angeles that has raised concern of a terrorist attack. After Charlie is recruited to help with the investigation, it is discovered that the flying object is part of a new technology that could revolutionize air travel. But the investigation takes a turn when they learn that the lead engineer is found murdered.', 'Y', 'N', 7.1),
	('Numb3rs', 'Man Hunt', 1, 13, 'Yes', 'Yes', 'No', 13, 5, 2005, 'A dangerous felon escapes when a prison bus crashes and the FBI has reason to fear he\'s intent on revenge against the witness whose testimony put him in jail. However, finding the elusive killer proves to be a complicated challenge. Don teams up with Agent Billy Cooper, his former partner from the FBI\'s Fugitive Recovery Division, and Alan worries that Don\'s going to return to a more dark and obsessive time in his career.', 'Y', 'N', 7.8),
	('Numb3rs', 'Judgement Call', 2, 1, 'Yes', 'Yes', 'No', 23, 9, 2005, 'Don and Charlie investigate the murder of a judge\'s wife who was shot in her garage.  It\'s unclear whether she was the intended target or her husband, who was hearing a death penalty case involving a gang leader.  As the investigation continues, Don reconnects with a prosecutor whose life may also be in danger.', 'Y', 'N', 7.1),
	('Numb3rs', 'Better Or Worse', 2, 2, 'Yes', 'Yes', 'No', 30, 9, 2005, 'Don and his team are called in when a woman attempting to rob a jewelry store in Beverly Hills is shot by a security guard. Charlie assists the FBI by using the keyless remote from the woman\'s car to help identify her and locate the store owner\'s kidnapped wife and daughter.', 'Y', 'N', 7.4),
	('Numb3rs', 'Obsession', 2, 3, 'Yes', 'Yes', 'No', 7, 10, 2005, 'The FBI becomes involved in the stalking of a popular singer after she is threatened by an intruder in her house and reveals a series of threatening letters she\'s received through the mail. Charlie determines the letters are from two different people after analyzing the handwriting. When a photographer is found dead near the singer\'s house, Don believes the photographer was murdered and his death is somehow related to the stalking case. ', 'Y', 'N', 7.2),
	('Numb3rs', 'Calculated Risk', 2, 4, 'Yes', 'Yes', 'No', 14, 10, 2005, 'Don and Megan are called to the murder scene when the CFO of a powerful energy company - who was about to testify against her fellow executives - is murdered at her home and her son is the only witness. Knowing there could be thousands of disgruntled ex-employees, Don asks Charlie to narrow the list. ', 'Y', 'N', 7.4),
	('Numb3rs', 'Assassin', 2, 5, 'Yes', 'Yes', 'No', 21, 10, 2005, 'Don uncovers a secret code that begins the hunt for a skilled and trained assassin, and the efforts by the FBI to save the life of a Colombian exile living in Los Angeles.', 'Y', 'N', 7.3),
	('Numb3rs', 'Soft Target', 2, 6, 'Yes', 'Yes', 'No', 4, 11, 2005, 'Don and his team are summoned to locate the person who released potentially lethal gas in the city\'s subway system.', 'Y', 'N', 7.3),
	('Numb3rs', 'Convergence', 2, 7, 'Yes', 'Yes', 'No', 11, 11, 2005, 'When a father is killed in a home invasion, Don and his team investigate the connection between the murder and a rash of robberies in the upscale community.', 'Y', 'N', 7.5),
	('Numb3rs', 'In Plain Sight', 2, 8, 'Yes', 'Yes', 'No', 18, 11, 2005, 'Megan feels responsible for an agent\'s death following an explosion at a meth house the FBI had targeted for a bust. When the kingpin eludes capture, it\'s discovered he may also be involved in child pornography when one of the photographs on his computer turns out to be a young girl in a sexually explicit position. The picture sends Charlie on a crusade of his own, as he remembers a girl he knew as a young child that he suspected was being abused, and he\'s determined to save the little girl in the picture.', 'Y', 'N', 7.4),
	('Numb3rs', 'Toxin', 2, 9, 'Yes', 'Yes', 'No', 25, 11, 2005, 'After four people nearly die from poisoning, Don learns someone is tampering with nonprescription drugs. When the perpetrator publishes a manifesto in a local paper, Don is led to believe the person may be a former employee of the drug company that manufactured the drug. ', 'Y', 'N', 7.4),
	('Numb3rs', 'Bones Of Contention', 2, 10, 'Yes', 'Yes', 'No', 9, 12, 2005, 'When a researcher who specializes in Native American antiquities is killed at the museum where she works, the FBI is called in because the museum is on federal land.', 'Y', 'N', 7.2),
	('Numb3rs', 'Scorched', 2, 11, 'Yes', 'Yes', 'No', 16, 12, 2005, 'An arsonist sets a fire at a car dealership that kills a sales person. The name of an extremist environmental group is spray-painted on the scene, but the group denies involvement. It becomes Don\'s task to determine whether the group or someone else is responsible. Charlie is called in to help figure out if there is a pattern to the fires that would help provide a profile of the arsonist.', 'Y', 'N', 7.5),
	('Numb3rs', 'The OG', 2, 12, 'Yes', 'Yes', 'No', 6, 1, 2006, 'When Don and his team are called to the scene of the murder of a Los Angeles gang member, they learn they are investigating the murder of another agent who had been working undercover.', 'Y', 'N', 7.6),
	('Numb3rs', 'Double Down', 2, 13, 'Yes', 'Yes', 'No', 13, 1, 2006, 'A murder investigation at a Los Angeles card club leads the FBI to a complicated card-counting scheme involving college students.', 'Y', 'N', 7.5),
	('Numb3rs', 'Harvest', 2, 14, 'Yes', 'Yes', 'No', 27, 1, 2006, 'When an Asian teenager is found in the basement of an old downtown hotel where she was apparently being tortured, the investigation soon reveals the girl and three other missing women, are victims of a black market organ-harvesting scheme. Amita assists the FBI by communicating with the girl, who is from the same part of India where Amita\'s family once lived.', 'Y', 'N', 7.5),
	('Numb3rs', 'The Running Man', 2, 15, 'Yes', 'Yes', 'No', 3, 2, 2006, 'When a DNA synthesizer with the capability of customizing diseases is stolen from the campus where Charlie teaches, Don fears the thieves may be terrorists out to start or advance a bio-warfare program and also believes the theft was an inside job.', 'Y', 'N', 7.6),
	('Numb3rs', 'Protest', 2, 16, 'Yes', 'Yes', 'No', 3, 3, 2006, 'Don and his team investigate an anti-war bombing outside an Army recruiting center that resembles the work of a 1970s anti-war activist who disappeared 30 years earlier after being accused of planting a bomb that killed two people. Retired Agent Thomas Larson, who tried to solve the case 30 years ago, returns to help but questions Don\'s loyalty when it is revealed Alan knew the radical activist and participated in demonstrations with him, thus causing tension within the family.', 'Y', 'N', 7.4),
	('Numb3rs', 'Mind Games', 2, 17, 'Yes', 'Yes', 'No', 10, 3, 2006, 'Don and his agents are asked to investigate when a search team finds three dead women in the wilderness who were apparently murdered under bizarre circumstances. The case becomes more suspicious when Don learns the search team was led to the crime scene by a psychic. When the psychic offers to help the FBI in solving the crime, Charlie is determined to prove the psychic is a fraud. ', 'Y', 'N', 7.3),
	('Numb3rs', 'All\'s Fair', 2, 18, 'Yes', 'Yes', 'No', 31, 3, 2006, 'In an effort to find the murderer of an Iraqi woman who had been making a documentary that promoted the rights of Muslim women, Don enlists the help of the victim\'s cousin. Through her cousin, Don uncovers a connection to Saddam Hussein. Back at home, Charlie rekindles a romantic relationship with a former girlfriend when she visits him while on a book signing tour.', 'Y', 'N', 7.5),
	('Numb3rs', 'Dark Matter', 2, 19, 'Yes', 'Yes', 'No', 7, 4, 2006, 'Don and his team investigate a school shooting. He learns two students could have a strong motive, so Charlie uses the school\'s radio frequency identification system to track the shooters\' movements through the school\'s hallways. When Charlie detects an abnormal pattern, the agents take a look at the evidence and discover a third participant no one had suspected earlier.', 'Y', 'N', 7.7),
	('Numb3rs', 'Guns And Roses', 2, 20, 'Yes', 'Yes', 'No', 21, 4, 2006, 'When an ATF agent is found dead under unusual circumstances, Don wants to take the case, which revolves around an elaborate bank robbery, after he learns the victim was his former girlfriend. He then becomes quite introspective as he realizes the impact his career has had on his personal life and decides to turn his attention toward a new woman.', 'Y', 'N', 7.3),
	('Numb3rs', 'Rampage', 2, 21, 'Yes', 'Yes', 'No', 28, 4, 2006, 'When an assailant opens fire in the FBI offices, Don and his team must determine his motive and possible connection to a dangerous arms dealer who is on trial. After nearly getting shot, Charlie is shaken and reluctant to return to the offices, which hinders his contribution to the case.', 'Y', 'N', 7.8),
	('Numb3rs', 'Backscatter', 2, 22, 'Yes', 'Yes', 'No', 5, 5, 2006, 'An FBI investigation into a computer hacking scam that taps into a bank\'s system to gain access to the identities and financial assets of its customers becomes personal for Don and the Eppes family.', 'Y', 'N', 8),
	('Numb3rs', 'Undercurrents', 2, 23, 'Yes', 'Yes', 'No', 12, 5, 2006, 'The FBI becomes involved when the bodies of young Asian girls are washed up on the beach. The situation becomes more critical when it is discovered one girl has avian flu. As the investigation continues, Don and his team discover a connection between the girls and the sex trade industry. Meanwhile, Amita considers a transfer to Harvard University, which causes Charlie to re-evaluate his feelings for her. ', 'Y', 'N', 7.5),
	('Numb3rs', 'Hot Shot', 2, 24, 'Yes', 'Yes', 'No', 19, 5, 2006, 'Don investigates the murders of two young women found in their cars outside their homes. Their deaths were made to look like drug overdoses, but Don realizes a serial killer is responsible. Meanwhile, Charlie is having bizarre dreams about his parents. In one dream, his deceased mother appears and tells him he has a question to ask her, but he can\'t imagine what it could be.', 'Y', 'N', 7.3),
	('Numb3rs', 'Spree', 3, 1, 'Yes', 'Yes', 'No', 22, 9, 2006, 'Don has a problem. Crystal Hoyle and her boyfriend Buck are going on a robbery and killing spree. Their terror is spread over seven states, and Charlie is called in to help. However, problems between Alan and Charlie may hinder Charlie\'s concentration.', 'Y', 'N', 7.9),
	('Numb3rs', 'Two Daughters', 3, 2, 'Yes', 'Yes', 'No', 29, 9, 2006, 'David tries to get information from one of Crystal\'s old boyfriends, but he isn\'t helping. Things get personal for the team when Crystal kidnaps one of them.', 'Y', 'N', 8),
	('Numb3rs', 'Provenance', 3, 3, 'Yes', 'Yes', 'No', 6, 10, 2006, 'Don and the rest of the team find themselves in the midst of a confusing case. The investigation into a missing painting turns grim as a murder plot surfaces. Add Nazis to the mix, and things take an even more interesting turn!', 'Y', 'N', 7.8),
	('Numb3rs', 'The Mole', 3, 4, 'Yes', 'Yes', 'No', 13, 10, 2006, 'Don and the team attempt to figure out what happened when a Chinese interpreter turns up dead.', 'Y', 'N', 7.4),
	('Numb3rs', 'Traffic', 3, 5, 'Yes', 'Yes', 'No', 20, 10, 2006, 'Don and the rest of the team investigate several attacks occurring on LA highways that may be connected.', 'Y', 'N', 7.6),
	('Numb3rs', 'Longshot', 3, 6, 'Yes', 'Yes', 'No', 27, 10, 2006, 'Don and the team investigate a suspicious death at a horse track. When Charlie starts looking into the crime, he uncovers something that will send the investigation into an entirely different direction.', 'Y', 'N', 7.6),
	('Numb3rs', 'Blackout', 3, 7, 'Yes', 'Yes', 'No', 3, 11, 2006, 'Blackouts leave Los Angeles in the dark. Don must work with his entire team to figure out if the power outages are a catastrophic accident or the sinister plot of terrorists.', 'Y', 'N', 7.7),
	('Numb3rs', 'Hardball', 3, 8, 'Yes', 'Yes', 'No', 10, 11, 2006, 'The case of a dead minor league baseball player leaves Don and the team with more questions than answers. When Charlie discovers that someone has come up with a statistical analysis that can identify which of the players are on steriods, the case gets more leads...and a suspect.', 'Y', 'N', 7.6),
	('Numb3rs', 'Waste Not', 3, 9, 'Yes', 'Yes', 'No', 17, 11, 2006, 'The problem of the disposal of toxic waste becomes real to Don, Charlie and the team when several children are injured after a sinkhole collapses underneath a school playground. Charlie attempts to help with the case, but faces opposition from his new boss.', 'Y', 'N', 7.8),
	('Numb3rs', 'Brutus', 3, 10, 'Yes', 'Yes', 'No', 24, 11, 2006, 'A California State Senator and a psychiatrist--neither have much in common with the other except for one thing...they both turn up dead on Don\'s watch. While the circumstances of their deaths are different, Don thinks the two murders are related, and tries to prove his hunch right. What he finds may bring to light a deep secret the government has been hiding for years.', 'Y', 'N', 7.3),
	('Numb3rs', 'Killer Chat', 3, 11, 'Yes', 'Yes', 'No', 15, 12, 2006, 'Don and Charlie track a killer who has murdered several sex predators. The predators took advantage of teenage girls they met in chat rooms. Meanwhile, Larry is ready to begin an adventure with NASA.', 'Y', 'N', 7.8),
	('Numb3rs', 'Nine Wives', 3, 12, 'Yes', 'Yes', 'No', 5, 1, 2007, 'Don, Charlie, and the team search for a polygamist who is on the run. The man is on the FBI\'s Ten Most Wanted List for rape and murder.', 'Y', 'N', 7.8),
	('Numb3rs', 'Finders Keepers', 3, 13, 'Yes', 'Yes', 'No', 12, 1, 2007, 'After an extremely expensive yacht sinks in the middle of a race, Charlie is put between a rock and a hard place when Don and the NSA need his help on the case.', 'Y', 'N', 7.6),
	('Numb3rs', 'Take Out', 3, 14, 'Yes', 'Yes', 'No', 2, 2, 2007, 'When two police officers are killed while eating dinner out, Charlie tries to figure out where the killers will strike next. Don\'s superiors make him see the department shrink.', 'Y', 'N', 7.5),
	('Numb3rs', 'End Of Watch', 3, 15, 'Yes', 'Yes', 'No', 9, 2, 2007, 'Don and the team reopen a cold case when a LAPD badge turns up at a construction site. When Charlie joins the investigation, they attempt to track down the owner of the badge, an officer who has been missing 17 years. Meanwhile, Alan is informed that he\'s being sued.', 'Y', 'N', 7.4),
	('Numb3rs', 'Contenders', 3, 16, 'Yes', 'Yes', 'No', 16, 2, 2007, 'One of David\'s closest friends is called into question after a man dies while boxing with him. When it turns out this is not the first time such an event has happened, things look even worse. Charlie is busy practicing what little he knows about poker, so he can take Larry\'s spot in a tournament.', 'Y', 'N', 7.1),
	('Numb3rs', 'One Hour', 3, 17, 'Yes', 'Yes', 'No', 23, 2, 2007, 'Don talks to his therapist again, and while he\'s gone, the team races to find an eleven year-old boy being held on a $3 million ransom, and time is running out...', 'Y', 'N', 8.1),
	('Numb3rs', 'Democracy', 3, 18, 'Yes', 'Yes', 'No', 9, 3, 2007, 'Several area murders seem to be tied to voter fraud. Don, Charlie, and the team must find the killers before they strike again.', 'Y', 'N', 7.2),
	('Numb3rs', 'Pandora\'s Box', 3, 19, 'Yes', 'Yes', 'No', 30, 3, 2007, 'When a jet crashes in the middle of a forest, Charlie suspects that there is more to the crash than what meets the eye.', 'Y', 'N', 7.4),
	('Numb3rs', 'Burn Rate', 3, 20, 'Yes', 'Yes', 'No', 6, 4, 2007, 'When Don investigates a series of bombings, he calls in Charlie to help pinpoint the bomber. But the two disagree over who the culprit is. Is it a new terrorist, or an old enemy?', 'Y', 'N', 7.5),
	('Numb3rs', 'The Art Of Reckoning', 3, 21, 'Yes', 'Yes', 'No', 27, 4, 2007, 'When a former mob hit man on death row suddenly has a change of heart and agrees to confess to his crimes, Don has an uneasy feeling about the whole affair.', 'Y', 'N', 7.8),
	('Numb3rs', 'Under Pressure', 3, 22, 'Yes', 'Yes', 'No', 4, 5, 2007, 'Don, Charlie, and the team take on unknown terrorists who may be using nerve gas to undermine Los Angeles\' water supply.', 'Y', 'N', 7.6),
	('Numb3rs', 'Money For Nothing', 3, 23, 'Yes', 'Yes', 'No', 11, 5, 2007, '$50 million dollars in medical relief is up for grabs after the shipment is stolen. But there\'s a catch--someone other than the FBI wants to recover the shipment. Don and the team find themselves pitted against blackmarketeers in a deadly race for the supplies.', 'Y', 'N', 7.6),
	('Numb3rs', 'The Janus List', 3, 24, 'Yes', 'Yes', 'No', 18, 5, 2007, 'In the midst of investigating a serious bomb threat, Don and Charlie uncover a secret that could change their lives and the lives of the team forever.', 'Y', 'N', 8.6),
	('Numb3rs', 'Trust Metric', 4, 1, 'Yes', 'Yes', 'No', 28, 9, 2007, 'After the events of \'The Janus List\', Colby escapes from custody. Don and the team go after him, but everything may not be as it seems.', 'Y', 'N', 8.5),
	('Numb3rs', 'Hollywood Homicide', 4, 2, 'Yes', 'Yes', 'No', 5, 10, 2007, 'An actor on his way to stardom finds himself in the middle of a murder investigation when a young woman is murdered in his house.', 'Y', 'N', 7.3),
	('Numb3rs', 'Velocity', 4, 3, 'Yes', 'Yes', 'No', 12, 10, 2007, 'When a car crashes into a busy coffee shop, the team discovers the fatal act might not have been an accident.', 'Y', 'N', 7.4),
	('Numb3rs', 'Thirteen', 4, 4, 'Yes', 'Yes', 'No', 19, 10, 2007, 'Don, Charlie, and the team attempt to stop a serial killer who is seemingly obsessed with people resembling Biblical figures.', 'Y', 'N', 7.7),
	('Numb3rs', 'Robin Hood', 4, 5, 'Yes', 'Yes', 'No', 26, 10, 2007, 'Robberies the storybook hero would have been proud to claim plague Don and Charlie as they attempt to catch a do-good thief who is donating his spoils to charity.', 'Y', 'N', 7.7),
