	('Numb3rs', 'Primacy', 4, 7, 'Yes', 'Yes', 'No', 9, 11, 2007, 'When a man is found dead, the team enters the world of alternate reality gaming. However, their investigation leads to a danger for a loved one.', 'Y', 'N', 8),
	('Numb3rs', 'Tabu', 4, 8, 'Yes', 'Yes', 'No', 16, 11, 2007, 'When a wealthy heiress is kidnapped, Don and the team race against the clock in hopes to find her. However, the motivations behind her disappearance aren\'t what they seem.', 'Y', 'N', 7.5),
