	('Numb3rs', 'When Worlds Collide', 4, 18, 'Yes', 'Yes', 'No', 16, 5, 2008, 'In the season finale, Don and Charlie work together on a case that ends up with them going head to head about their personal beliefs, and one team member will walk away forever.', 'Y', 'N', 8.3),
	('Numb3rs', 'High Exposure', 5, 1, 'Yes', 'Yes', 'No', 3, 10, 2008, 'Two rock climbers in possession of a large stolen diamond are killed, and Don and the team hunt for the murderers; Charlie considers whether he should have his FBI clearance reinstated.', 'Y', 'N', 7.9),
	('Numb3rs', 'The Decoy Effect', 5, 2, 'Yes', 'Yes', 'No', 10, 10, 2008, 'The team investigates an increase in ATM kidnappings when a woman who was abducted and forced to withdraw money is murdered. Charlie meets the investigator who will decide the fate of his FBI security clearance.', 'Y', 'N', 8),
	('Numb3rs', 'Blowback', 5, 3, 'Yes', 'Yes', 'No', 17, 10, 2008, 'When eight people, including two police officers, are gunned down in a coffee shop, Don and his team uncover a trail of blackmail, corruption and romance; McGowan expands his investigation of Charlie and Don.', 'Y', 'N', 8.1),
	('Numb3rs', 'Jack Of All Trades', 5, 4, 'Yes', 'Yes', 'No', 24, 10, 2008, 'Don\'s team helps Agent Bloom, a veteran with the FBI, track down a con man who has eluded Bloom for years. Meanwhile, the final decision on Charlie\'s clearance is handed down, and it doesn\'t just affect Charlie. Don\'s job is on the line as well.', 'Y', 'N', 8.1),
	('Numb3rs', 'Scan Man', 5, 5, 'Yes', 'Yes', 'No', 31, 10, 2008, 'The team investigates a crew stealing high-end goods from a shipping service. Don questions his faith in the FBI when one of his men is killed on duty.', 'Y', 'N', 8.2),
	('Numb3rs', 'Magic Show', 5, 6, 'Yes', 'Yes', 'No', 7, 11, 2008, 'Don and the team investigate when a magician mysteriously vanishes during an illusion.', 'Y', 'N', 7.7),
	('Numb3rs', 'Charlie Don\'t Surf', 5, 7, 'Yes', 'Yes', 'No', 14, 11, 2008, 'One of Don and Charlie\'s friends dies in what is deemed an accident. Not convinced, the brothers investigate further and uncover something shocking.', 'Y', 'N', 7.6),
	('Numb3rs', 'Thirty-Six Hours', 5, 8, 'Yes', 'Yes', 'No', 21, 11, 2008, 'When a passenger train collides with a freight train David (Alimi Ballard), Don, and Colby are called in to help rescue survivors and to investigate the cause of the crash', 'Y', 'N', 8.2),
	('Numb3rs', 'Conspiracy Theory', 5, 9, 'Yes', 'Yes', 'No', 5, 12, 2008, 'The team sifts through various rumors about a controversial charity organization to find the guilty party after its office building is bombed.', 'Y', 'N', 7.8),
