	('Numb3rs', 'Sneakerhead', 5, 14, 'Yes', 'Yes', 'No', 6, 2, 2009, 'The team searches for a pair of limited edition sneakers after they are stolen from a foreign ambassador.', 'Y', 'N', 7.5),
	('Numb3rs', 'Guilt Trip', 5, 15, 'Yes', 'Yes', 'No', 13, 2, 2009, 'When a case against a weapons smuggler falls apart, the team takes a closer look at the jury that heard the case, searching for signs of jury tampering.', 'Y', 'N', 7.7),
	('Numb3rs', 'Cover Me', 5, 16, 'Yes', 'Yes', 'No', 27, 2, 2009, 'Charlie puts together a plan to stop a dangerous drug from hitting the streets of LA. Will his plan work? Or will it cost the life of one of Don\'s agents?', 'Y', 'N', 8.1),
	('Numb3rs', 'First Law', 5, 17, 'Yes', 'Yes', 'No', 6, 3, 2009, 'The team\'s number one suspect in the death of a scientist is a super computer.', 'Y', 'N', 7.9),
	('Numb3rs', '12.01 AM', 5, 18, 'Yes', 'Yes', 'No', 13, 3, 2009, 'The team gets a last minute tip that could exonerate a dangerous mob boss who is about to be executed. Charlie tries to help the CalSci basketball team break their losing streak.', 'Y', 'N', 7.7),
	('Numb3rs', 'Animal Rites', 5, 19, 'Yes', 'Yes', 'No', 10, 4, 2009, 'The investigation into a professor\'s death takes a dangerous turn when the team finds their lead suspect has ties to a radical animal rights group.', 'Y', 'N', 7.5),
	('Numb3rs', 'The Fifth Man', 5, 20, 'Yes', 'Yes', 'No', 24, 4, 2009, 'Don\'s life hangs in the balance after he is injured during a raid while investigating a series of home invasions.', 'Y', 'N', 8.1),
	('Numb3rs', 'Disturbed', 5, 21, 'Yes', 'Yes', 'No', 1, 5, 2009, 'Feeling guilty over the stabbing, Charlie puts his attention on finding a serial killer using math theories to help the team solve the case before another life is taken.', 'Y', 'N', 8.1),
	('Numb3rs', 'Greatest Hits', 5, 22, 'Yes', 'Yes', 'No', 8, 5, 2009, 'Don and the team are sent to look into a series of bank robberies and soon name former FBI Agent Roger Bloom as their lead suspect.', 'Y', 'N', 8.1),
	('Numb3rs', 'Angels And Devils', 5, 23, 'Yes', 'Yes', 'No', 15, 5, 2009, 'When Amita is abducted, Don and the team\'s frantic search for her leads them to the delusional head of a cult, but it is up to a distraught Charlie to discover what the suspect\'s bizarre plans for her are.', 'Y', 'N', 8.4),
	('Numb3rs', 'Hangman', 6, 1, 'Yes', 'Yes', 'No', 25, 9, 2009, 'Don and his team are out to protect former radical Benjamin Polk from a determined sniper who wants him dead, and who is leading the FBI on a cat-and-mouse chase as he closes in on his prey.', 'Y', 'N', 7.9),
	('Numb3rs', 'Friendly Fire', 6, 2, 'Yes', 'Yes', 'No', 2, 10, 2009, 'When two FBI agents, part of a unit headed by Don\'s former mentor, are killed during a shootout with bank robbers, the team must investigate what exactly happened. Also, Charlie and Amita worry when Larry opts not to attend a conference in Geneva.', 'Y', 'N', 8),
	('Numb3rs', '7 Men Out', 6, 3, 'Yes', 'Yes', 'No', 9, 10, 2009, 'Don and his team are called in to investigate who is behind a deadly gambling ring that is running a high-stakes Russian roulette tournament. Also, Don and Charlie become concerned about Alan\'s financial health.', 'Y', 'N', 7.7),
	('Numb3rs', 'Where Credit\'s Due', 6, 4, 'Yes', 'Yes', 'No', 16, 10, 2009, 'As Larry prepares to embark on his adventure, the team must investigate a string of murders. The case takes an interesting turn when it is discovered that the murders mimic scenes from a movie that hasn\'t even been released yet.', 'Y', 'N', 7.9),
	('Numb3rs', 'Hydra', 6, 5, 'Yes', 'Yes', 'No', 23, 10, 2009, 'The team attempts to find the daughter of a geneticist who they suspect was kidnapped by the unstable mother. However, they become concerned about the case when they find evidence that suggests the young girl was a clone. Meanwhile, Charlie and Amita discuss having kids and Liz reveals a dark secret.', 'Y', 'N', 7.8),
	('Numb3rs', 'Dreamland', 6, 6, 'Yes', 'Yes', 'No', 30, 10, 2009, 'The team investigates a decommissioned air base after a woman is found dead there, but their investigation is interrupted by paranormal happenings.', 'Y', 'N', 7.8),
	('Numb3rs', 'Shadow Markets', 6, 7, 'Yes', 'Yes', 'No', 6, 11, 2009, 'A shrewd computer hacker cuts the ground from up under an undercover sting operation to bag a cyber crime lord. His actions trigger a turf war putting his life in peril.', 'Y', 'N', 8),
	('Numb3rs', 'Ultimatum', 6, 8, 'Yes', 'Yes', 'No', 13, 11, 2009, 'While tracking down a felon running a heroin ring inside a prison, Agent Ian Edgerton becomes a murder suspect when the informant he meets with ends up dead, sending a desperate Edgerton over the edge when he takes a member of Don\'s team hostage.', 'Y', 'N', 8.4),
	('Numb3rs', 'Con Job', 6, 9, 'Yes', 'Yes', 'No', 20, 11, 2009, 'Charlie and Don reluctantly enlist the help of imprisoned con man John Buckley to help them catch a crook who\'s using Buckley\'s M.O. to rob the Diamond Exchange..', 'Y', 'N', 8.6),
	('Numb3rs', 'Old Soldiers', 6, 10, 'Yes', 'Yes', 'No', 4, 12, 2009, 'When the team foils a robbery of an armored car full of Federal Reserve money and recover bills that trace back to the infamous D.B. Cooper heist, they call on Agent Roger Bloom, who worked on the Cooper case, for help with the investigation. Henry Winkler returns as former FBI Agent Roger Bloom, and Michael Hogan, the uncle of the slain armored car driver and a key player in the investigation.', 'Y', 'N', 8.2),
	('Numb3rs', 'Scratch', 6, 11, 'Yes', 'Yes', 'No', 8, 1, 2010, 'Charlie meets his mathematical equivalent when lottery agent Jane assists in the investigation into a complex scam that involves thefts of unsold lottery tickets.', 'Y', 'N', 8),
	('Numb3rs', 'Arm In Arms', 6, 12, 'Yes', 'Yes', 'No', 15, 1, 2010, 'The gang uses their math and a reluctant gun merchant named Randall P. to track down a missing shipment of new, deadly but defective assault weapons which are hidden among the thousands of containers in one of L.A.\'s busiest ports.', 'Y', 'N', 8),
	('Numb3rs', 'Devil Girl', 6, 13, 'Yes', 'Yes', 'No', 29, 1, 2010, 'The Numbers team tracks a serial killer who targets johns.', 'Y', 'N', 7.9),
	('Numb3rs', 'And The Winner Is...', 6, 14, 'Yes', 'Yes', 'No', 5, 2, 2010, 'The Numbers team hunts for a gang of criminals who targeted an unlikely scene of the crime: a televised entertainment awards show.', 'Y', 'N', 7.7),
	('Numb3rs', 'Growin\' Up', 6, 15, 'Yes', 'Yes', 'No', 5, 3, 2010, 'The team investigates the deaths of two men who were part of a group of friends that had been sexually assaulted by a teacher when they were young boys. Also, Charlie and Amita get a fantastic job opportunity that could put a wrinkle in their wedding plans.', 'Y', 'N', 7.8),
	('Numb3rs', 'Cause And Effect', 6, 16, 'Yes', 'Yes', 'No', 12, 3, 2010, 'After Charlie and Amita get married and begin preparations for their London adventure, they put a slight hold on their wedded bliss when they assist the team in helping Don track down the whereabouts of his gun after it goes missing.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'Pilot', 1, 1, 'Yes', 'Yes', 'No', 23, 10, 2011, 'Emma does not believe in Henry\'s stories, and she brings him back to Storybrooke, where she is captivated by an unusual boy. Concerned for the boy, she decides to stay for a while, but soon discovers that Storybrooke is more than a simple town. It\'s a place where magic has been forgotten, but it\'s still there, where fairytale characters come alive, even though if they do not remember who they once were, and the Evil Queen, is now Henry\'s foster mother. An epic battle is beginning, and for the good side to win, Emma will have to accept her destiny and fight for it.', 'Y', 'N', 8.4),
	('Once Upon A Time', 'The Thing You Love Most', 1, 2, 'Yes', 'Yes', 'No', 30, 10, 2011, 'Regina tries to force Emma out of Storybrooke and out of her and Henry\'s lives permanently. Meanwhile, it is revealed how the Evil Queen released the curse upon the fairytale world.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'Snow Falls', 1, 3, 'Yes', 'Yes', 'No', 6, 11, 2011, 'Mary Margaret is astonished at the outcome after she reads to John Doe from the storybook while visiting him at the hospital. Back in fairytale world, Snow White and Prince Charming meet up for the first time.', 'Y', 'N', 8.2),
	('Once Upon A Time', 'The Price Of Gold', 1, 4, 'Yes', 'Yes', 'No', 13, 11, 2011, 'A pregnant woman enlists Emma\'s help to escape from Storybrooke - and from the enigmatic Mr. Gold - while a secret deal made between Cinderella and Rumpelstiltskin is revealed. ', 'Y', 'N', 8.2),
	('Once Upon A Time', 'That Still Small Voice', 1, 5, 'Yes', 'Yes', 'No', 27, 11, 2011, 'As Sheriff Graham deputizes Emma, the ground shakes and a giant sinkhole mysteriously appears at the edge of town. But a curious Henry\'s life is placed in danger when he decides to explore the innards of the sinkhole to see if its contents can link the inhabitants of Storybrooke to the fairytale world. Meanwhile, back in the fairytale world, Jiminy Cricket yearns to leave the family business and transform into the person he wants to be.', 'Y', 'N', 8.2),
	('Once Upon A Time', 'The Shepherd', 1, 6, 'Yes', 'Yes', 'No', 4, 12, 2011, 'David - aka John Doe - must choose between staying with Kathryn or leaving her to be with Mary Margaret, with whom he\'s fallen deeply, and inexplicably, in love; and Emma catches Sheriff Graham in a lie. Meanwhile, back in the fairytale world that was, Prince Charming is about to encounter a life-changing event that will forever alter his destiny.', 'Y', 'N', 8),
	('Once Upon A Time', 'The Heart Is A Lonely Hunter', 1, 7, 'Yes', 'Yes', 'No', 11, 12, 2011, 'One of the town\'s residents begins to remember their fairytale past, and Storybrooke mourns the loss of one of their own. Meanwhile, in the fairytale world that was, the Evil Queen attempts to find a heartless assassin to murder Snow White.', 'Y', 'N', 8.9),
	('Once Upon A Time', 'Desperate Souls', 1, 8, 'Yes', 'Yes', 'No', 8, 1, 2012, 'Regina and Mr. Gold play dirty politics and take opposite sides when Emma runs for a coveted Storybrooke public office against Sidney. Meanwhile, back in the fairytale world that was, Rumplestiltskin tries to track down the ultimate power source in order to help his son avert the horrors of a meaningless war.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'True North', 1, 9, 'Yes', 'Yes', 'No', 15, 1, 2012, 'Feeling their pain from having lived through the same experience, Emma desperately tries to help two homeless children find their birth father before they\'re separated and put into the foster care system. Meanwhile, back in the fairytale world that was, the Evil Queen coerces Hansel and Gretel into stealing an important artifact from a blind witch.', 'Y', 'N', 8.2),
	('Once Upon A Time', '7-15 AM', 1, 10, 'Yes', 'Yes', 'No', 22, 1, 2012, 'Mary Margaret and David continue to grapple with their unrequited love, and Emma and Regina grow suspicious over a mysterious new stranger in town. Meanwhile, in the fairytale land that was, Snow White yearns to ease her breaking heart as Prince Charming\'s wedding to King Midas\'s daughter approaches.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'Fruit Of The Poisonous Tree', 1, 11, 'Yes', 'Yes', 'No', 29, 1, 2012, 'A dejected Sidney enlists the aid of Emma to help uncover evidence that could expose Mayor Regina as the corrupt person she really is to the townspeople of Storybrooke. Mary Margaret and David continue their secret rendezvous while trying to figure out a way to unleash their forbidden love.', 'Y', 'N', 8.2),
	('Once Upon A Time', 'Skin Deep', 1, 12, 'Yes', 'Yes', 'No', 12, 2, 2012, 'After Mr. Gold\'s house is robbed, Emma keeps a close eye on him when it looks like he wants to track down the criminal and dole out some vigilante justice as payback, and Valentine\'s Day finds Mary Margaret, Ruby and Ashley having a girls\' night out. Meanwhile, in the fairytale land that was, Belle agrees to a fateful deal to give up her freedom in order to save her town from the horrors of the Ogre war. ', 'Y', 'N', 9),
	('Once Upon A Time', 'What Happened To Frederick', 1, 13, 'Yes', 'Yes', 'No', 19, 2, 2012, 'With their love for each other growing stronger, David finally agrees to tell Kathryn about his relationship with Mary Margaret and put an end to his loveless marriage. Meanwhile, in the fairytale land that was, while runaway groom Prince Charming searches for Snow White, he agrees to aid Abigail on a dangerous mission to recover something precious that was lost to her.', 'Y', 'N', 8.1),
	('Once Upon A Time', 'Dreamy', 1, 14, 'Yes', 'Yes', 'No', 4, 3, 2012, 'Unlikely allies Mary Margaret and Leroy team together for a good cause to help the Storybrooke nuns sell their candles during the town\'s Miner\'s Day festival. But Leroy makes a promise to a nun, Astrid, that he may not be able to keep; and Emma looks into the mysterious disappearance of David\'s wife, Kathryn. Meanwhile, in the fairytale land that was, Grumpy finds forbidden love with beautiful but clumsy fairy Nova. ', 'Y', 'N', 8.2),
	('Once Upon A Time', 'Red-Handed', 1, 15, 'Yes', 'Yes', 'No', 11, 3, 2012, 'After Ruby quits Granny\'s diner and with her self-esteem at an all-time low, Emma hires her as an assistant in order to help Ruby discover what it is in life that she\'s good at; and Emma continues questioning David about the disappearance - and possible murder - of Kathryn. Meanwhile, in the fairytale land that was, Red Riding Hood yearns to run away with her true love. But she, along with her fellow townspeople, are virtual prisoners when a bloodthirsty wolf continues on its relentless killing spree.', 'Y', 'N', 8.7),
	('Once Upon A Time', 'Heart Of Darkness', 1, 16, 'Yes', 'Yes', 'No', 18, 3, 2012, 'Mary Margaret hires Mr. Gold as her attorney when Emma is forced to arrest her for the suspected murder of David\'s wife, Kathryn. Meanwhile, back in the fairytale land that was, Prince Charming sets out to stop a determined and unhinged Snow White, whose memory is still clouded by Rumplestiltskin\'s potion, from assassinating the Evil Queen.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'Hat Trick', 1, 17, 'Yes', 'Yes', 'No', 25, 3, 2012, 'While searching for a missing Mary Margaret, Emma is kidnapped by a man whose affinity for hats has him teetering on the edge of madness. Meanwhile, viewers will be transported outside of the fairytale land that was for the first time when the Evil Queen persuades a skillful man of magic to come work for her one last time and travel to Wonderland in order to help steal something from the Queen of Hearts.', 'Y', 'N', 8.8),
	('Once Upon A Time', 'The Stable Boy', 1, 18, 'Yes', 'Yes', 'No', 1, 4, 2012, 'Emma continues her exhaustive search for evidence that will prove Mary Margaret\'s innocence in the murder of David\'s wife, Kathryn. Meanwhile, in the fairytale land that was and before evil blackened her soul, Regina must choose between betraying her mother, Cora, and marrying for true love, or betrothing royalty and living a regal - but loveless - life; and the event that caused the Evil Queen to loathe Snow White is revealed.', 'Y', 'N', 8.8),
	('Once Upon A Time', 'The Return', 1, 19, 'Yes', 'Yes', 'No', 22, 4, 2012, 'Mr. Gold attempts to uncover the true identity of August, Emma confronts Regina about her involvement in Kathryn\'s disappearance, and David tries to apologize and reconcile with Mary Margaret. Meanwhile, in the fairytale land that was, Rumplestiltskin agrees to comply and do whatever it takes if his son can find a way for him to safely give up his powers and turn back into the loving man he used to be.', 'Y', 'N', 8.4),
	('Once Upon A Time', 'The Stranger', 1, 20, 'Yes', 'Yes', 'No', 29, 4, 2012, 'August tells Emma how to beat Regina and how she can get custody of Henry, while Regina hatches a plot to seduce David now that Mary Margaret is back at work. In the fairy-tale world, a plan to save Snow White and Prince Charming\'s daughter unfolds and is agreed to by Geppetto, who has his own child\'s safety in mind.', 'Y', 'N', 8.7),
	('Once Upon A Time', 'An Apple Red As Blood', 1, 21, 'Yes', 'Yes', 'No', 6, 5, 2012, 'Henry pleads with Emma to stay in Storybrooke and continue her quest as the savior of the fairytale dwellers, and Regina concocts a plan that could rid her of Emma forever. Meanwhile, back in the fairytale land that was, Snow White enlists the aid of her fellow fairytale cohorts to attack the Evil Queen and save Prince Charming\'s life.', 'Y', 'N', 8.7),
	('Once Upon A Time', 'A Land Without Magic', 1, 22, 'Yes', 'Yes', 'No', 13, 5, 2012, 'Emma and Regina team together in order to find a way to save Henry\'s life. Meanwhile, in the fairytale land that was, Prince Charming attempts to escape from the Evil Queen\'s clutches in order to reunite with Snow White who, unbeknownst to him, has already taken a bite of the Queen\'s poison apple.', 'Y', 'N', 9),
	('Once Upon A Time', 'Broken', 2, 1, 'Yes', 'Yes', 'No', 30, 9, 2012, 'As fairytale characters awaken from Queen Regina\'s curse, they are not transported back to their home; Prince Phillip and his traveling companion realize they will be facing a deadly foe.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'We Are Both', 2, 2, 'Yes', 'Yes', 'No', 7, 10, 2012, 'Regina continues to seek a way to regain her powers. David continues his quest to find Mary Margaret and Emma, the seven dwarves discover what happens when one of the townspeople tries to leave Storybrooke\'s city limits.', 'Y', 'N', 8.2),
	('Once Upon A Time', 'Lady Of The Lake', 2, 3, 'Yes', 'Yes', 'No', 14, 10, 2012, 'Emma and Mary Margaret try to find a portal that would bring them back to Storybrooke; Henry tries to talk Jefferson into reuniting with his daughter; on the eve of meeting Prince Charming\'s mother, King George poisons Snow White.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'The Crocodile', 2, 4, 'Yes', 'Yes', 'No', 21, 10, 2012, 'Belle threatens to leave Mr. Gold if he doesn\'t change his ways, the dwarves try to find fairy dust in the Storybrooke mine. Rumplestilskin tries to save his wife from a band of pirates.', 'Y', 'N', 8.7),
	('Once Upon A Time', 'The Doctor', 2, 5, 'Yes', 'Yes', 'No', 28, 10, 2012, 'As Regina tries to refrain from using her magic in order to regain Henry\'s trust, she starts seeing a ghost from her past; Mary Margaret and Emma find a survivor from an Ogre massacre; Regina struggles to learn the dark arts.', 'Y', 'N', 8.1),
	('Once Upon A Time', 'Tallahassee', 2, 6, 'Yes', 'Yes', 'No', 4, 11, 2012, 'Emma follows Capt. Hook up a beanstalk in hope of finding a magical compass, a fellow thief wants to make an honest woman out of Emma.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'Child Of The Moon', 2, 7, 'Yes', 'Yes', 'No', 11, 11, 2012, 'Ruby\'s fear about turning into a wolf is confirmed when she becomes the prime suspect for a vicious murder. Leroy finds treasure in a Storybrooke mine that could help Emma and Mary Margaret.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'Into The Deep', 2, 8, 'Yes', 'Yes', 'No', 25, 11, 2012, 'Cora tries to steal the compass from Emma and Mary Margaret. Regina and Mr. Gold must put David\'s life in danger in the hope that he will be able contact Mary Margaret.', 'Y', 'N', 8.4),
	('Once Upon A Time', 'Queen Of Hearts', 2, 9, 'Yes', 'Yes', 'No', 2, 12, 2012, 'Hook and Cora face off with Emma and Mary Margaret in a race for the compass. Mr. Gold and Regina plan to kill anyone who enters the portal.', 'Y', 'N', 8.9),
	('Once Upon A Time', 'The Cricket Game', 2, 10, 'Yes', 'Yes', 'No', 6, 1, 2013, 'When Regina is accused of murdering a beloved fairy-tale character, Emma thinks she is innocent; Prince Charming and Snow White plan the evil queen\'s execution.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'The Outsider', 2, 11, 'Yes', 'Yes', 'No', 13, 1, 2013, 'Mr. Gold finds an unwilling test subject to see if a spell he has concocted will allow him to cross the border of Storybrooke without losing his memory and go in search of his son, Bae; Belle stumbles upon a vengeful Hook in the Storybrooke harbor whose main goal is to eradicate Rumplestiltskin; and Mary Margaret and David go house hunting in search of a bigger place to live. Meanwhile, in the fairytale land that was, Belle meets Mulan as the two set out to slay a fearsome beast called the Yaoguai, who has been ravaging the land.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'In The Name Of The Brother', 2, 12, 'Yes', 'Yes', 'No', 20, 1, 2013, 'A stranger may be a threat to the true identity of the townspeople. Cora tries to reunite with Regina.', 'Y', 'N', 7.9),
	('Once Upon A Time', 'Tiny', 2, 13, 'Yes', 'Yes', 'No', 10, 2, 2013, 'Cora brings the giant to Storybrooke, where he unleashes vengeance on the town; Emma and Henry go with Mr. Gold to search for his son; Greg asks Belle what she saw on the night of his accident; Anton the Giant befriends humans.', 'Y', 'N', 8.1),
	('Once Upon A Time', 'Manhattan', 2, 14, 'Yes', 'Yes', 'No', 17, 2, 2013, 'Emma, Henry and Mr. Gold search for Gold\'s son in New York; Hook, Cora and Regina look for one of Rumplestiltskin\'s most precious possessions.', 'Y', 'N', 8.9),
	('Once Upon A Time', 'The Queen Is Dead', 2, 15, 'Yes', 'Yes', 'No', 3, 3, 2013, 'When Mary Margaret learns of Cora and Regina\'s plan for the dagger, she resolves to find it first; Mr. Gold continues his search for Bae; the Blue Fairy offers Snow White an enchantment to save her mother.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'The Miller\'s Daughter', 2, 16, 'Yes', 'Yes', 'No', 10, 3, 2013, 'Cora and Regina try to overpower Mr. Gold, dark magic tempts Mary Margaret. Rumplestiltskin offers his services to Cora.', 'Y', 'N', 8.9),
	('Once Upon A Time', 'Welcome To Storybrooke', 2, 17, 'Yes', 'Yes', 'No', 17, 3, 2013, 'David, Emma and Mr. Gold try to protect Mary Margaret from a vengeful Regina; a man and his son find their way into Storybrooke.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'Selfless, Brave And True', 2, 18, 'Yes', 'Yes', 'No', 24, 3, 2013, 'While off on her own to deal with what happened with Cora, Mary Margaret comes across an entirely wooden August; Neal invites his fiancee to Storybrooke.', 'Y', 'N', 8.1),
	('Once Upon A Time', 'Lacey', 2, 19, 'Yes', 'Yes', 'No', 21, 4, 2013, 'Mr. Gold asks David for help jogging Belle\'s memory. Anton\'s magic beans begin to grow. Rumpelstiltskin goes after a thief.', 'Y', 'N', 8.2),
	('Once Upon A Time', 'The Evil Queen', 2, 20, 'Yes', 'Yes', 'No', 28, 4, 2013, 'Hook helps Regina with a plan to transport her and Henry back to Fairytale land. Emma grows increasingly suspicious of Tamara, the queen asks Rumpelstiltskin to transform her so that she can kill Snow White.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'Second Star To The Right', 2, 21, 'Yes', 'Yes', 'No', 5, 5, 2013, 'Mary Margaret, David and Emma embark on a search when Regina and some magic beans go missing; Mr. Gold considers revealing the truth to Lacey; Bae winds up in 19th century London.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'And Straight On \'Til Morning', 2, 22, 'Yes', 'Yes', 'No', 12, 5, 2013, 'The inhabitants of Storybrooke brace themselves for the end when Greg and Tamara detonate the trigger Regina had placed within the curse, with the annihilation of the town and its residents imminent; and Mr. Gold mourns the loss of his son, Bae/Neal. Meanwhile, back in Neverland of the past, Hook discovers his connection to a young Bae after he rescues him from the sea and soon realizes that the Lost Boys are in hot pursuit of the boy.', 'Y', 'N', 8.9),
	('Once Upon A Time', 'The Heart Of The Truest Believer', 3, 1, 'Yes', 'Yes', 'No', 29, 9, 2013, 'Unfriendly mermaids threaten those searching for Henry in Neverland. Henry and another escapee from Peter Pan\'s encampment go on the run. a still-recovering Neal travels the enchanted forest with Mulan in search of Emma\'s and Henry\'s fates.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'Lost Girl', 3, 2, 'Yes', 'Yes', 'No', 6, 10, 2013, 'Peter Pan offers Emma a map that will help her find Henry, but she must come to terms with who she is in order to use it; Mr. Gold gets unexpected advice; Charming works to stop Snow from accepting a deal from the Evil Queen.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'Quite A Common Fairy', 3, 3, 'Yes', 'Yes', 'No', 13, 10, 2013, 'Hook suggests finding Tinker Bell and following her to Peter Pan\'s hideout. Pan tells Henry why he brought him to Neverland. Neal comes up with a plan that could transoprt him to Emma. Tinker Bell offers to help Regina.', 'Y', 'N', 8.4),
	('Once Upon A Time', 'Nasty Habits', 3, 4, 'Yes', 'Yes', 'No', 20, 10, 2013, 'Mr. Gold decides to confront Pan, one of Pan\'s most loyal Lost Boys holds Neal captive. David fights against the poison. Rumpelstiltskin searches for Bae.', 'Y', 'N', 8.4),
	('Once Upon A Time', 'Good Form', 3, 5, 'Yes', 'Yes', 'No', 27, 10, 2013, 'Hook brings ailing David with him to find the sextant that may help them decipher a map that shows the way out of Neverland. Killian Jones and his brother sail off to find a plant in an uncharted land.', 'Y', 'N', 8.7),
	('Once Upon A Time', 'Ariel', 3, 6, 'Yes', 'Yes', 'No', 3, 11, 2013, 'To repay Ariel for saving her life, Snow White helps her get acquainted with Prince Eric; Mr. Gold and Regina begrudgingly agree to work together to take down Pan.', 'Y', 'N', 8.7),
	('Once Upon A Time', 'Dark Hollow', 3, 7, 'Yes', 'Yes', 'No', 10, 11, 2013, 'Ariel is sent back to Storybrooke with an item that will help Belle find a hidden artifact; Hook, Neal and Emma set out to capture Peter Pan\'s shadow; Mary Margaret is upset that David concealed his poisoning.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'Think Lovely Thoughts', 3, 8, 'Yes', 'Yes', 'No', 17, 11, 2013, 'Pan tries to convince Henry that he can save magic and Neverland. a young Rumplestiltskin receives a magical item that could give him a fresh start with his father. ', 'Y', 'N', 9),
	('Once Upon A Time', 'Save Henry', 3, 9, 'Yes', 'Yes', 'No', 1, 12, 2013, 'While Henry\'s life hangs in the balance, the race is on to stop Pan from gaining full magical powers from the heart of the truest believer. Meanwhile, in Storybrooke of the past, Regina decides to fill a void in her life and, with Mr. Gold\'s help, sets out to adopt a baby.', 'Y', 'N', 8.4),
	('Once Upon A Time', 'The New Neverland', 3, 10, 'Yes', 'Yes', 'No', 8, 12, 2013, 'The residents of Storybrooke are overjoyed upon the return of Henry and our heroes from Neverland. But unbeknownst to them, a plan is secretly being put into place by a well-hidden Pan that will shake up the very lives of the townspeople. Meanwhile, in the Fairy Tale Land that was, Snow White and Prince Charming\'s honeymoon turns out to be anything but romantic when they go in search of a mythical being that could stop Regina cold in her tracks.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'Going Home', 3, 11, 'Yes', 'Yes', 'No', 15, 12, 2013, 'The race is on to stop Pan from enacting another curse on the residents of Storybrooke, which could kill every living soul in town', 'Y', 'N', 9.4),
	('Once Upon A Time', 'New York City Serenade', 3, 12, 'Yes', 'Yes', 'No', 9, 3, 2014, 'In New York, Hook tries to get Emma to remember who she really is. In the past, the Storybrooke residents return to the Enchanted Forest and are threatened by a threat like no other.', 'Y', 'N', 9),
	('Once Upon A Time', 'Witch Hunt', 3, 13, 'Yes', 'Yes', 'No', 16, 3, 2014, 'Emma arrives in Storybrooke with Henry and reunites with her friends and family, only to discover that no one remembers how they were transported back - or the past year they had spent back in Fairy Tale Land. But Emma is sure that someone in town is responsible for this new curse and teams up with Regina in an attempt to uncover their identity. Meanwhile, in the Fairy Tale Land that was during the past year, Regina, with the aid of Robin Hood, attempts to break into her castle.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'The Tower', 3, 14, 'Yes', 'Yes', 'No', 23, 3, 2014, 'While Emma, David, Regina and Hook continue their search for the Wicked Witch, she, in turn, is planning a dark surprise for David, and Zelenas prisoner is powerless under her watch as she plots her next course of action against the townspeople. Meanwhile, in the Fairy Tale Land that was in the previous year, Prince Charming stumbles upon Rapunzel, who is trapped inside a tower, and must help her confront her fears in order for her to be free.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'Quiet Minds', 3, 15, 'Yes', 'Yes', 'No', 30, 3, 2014, 'Neal finds himself back in Storybrooke and yearns for a way to reconnect with his son Henry, whose memories of his father are gone, while also trying to find his own father, Rumplestiltskin, whom he has just learned is alive but missing, and Regina discovers a possible connection with Robin Hood. Meanwhile, in the Fairy Tale Land that was over the past year, agonizing over the death of his father, Neal - with the help of Belle and enchanted candelabra Lumiere - attempts to find a magical solution to bring back Rumplestiltskin from the dead.', 'Y', 'N', 8.8),
	('Once Upon A Time', 'It\'s Not Easy Being Green', 3, 16, 'Yes', 'Yes', 'No', 6, 4, 2014, 'With Rumplestiltskin as her slave, Zelena challenges Regina to a fight to the death and shocks the Evil queen with the reveal of their familial connection, and the town lays Neal to rest. Meanwhile, back in the past in the land of Oz, a jealous Zelena asks the Wizard to send her to Fairy Tale Land after discovering that she has a sister, Regina, and that Rumplestiltskin is training her to become a powerful force to be reckoned with.', 'Y', 'N', 8.8),
	('Once Upon A Time', 'The Jolly Roger', 3, 17, 'Yes', 'Yes', 'No', 13, 4, 2014, 'Ariel returns to Storybrooke and pleads with Hook to help her find Prince Eric, who never returned to the town when the new curse was invoked. Emma agrees to let Regina teach her how to use magic so that she can help defeat Zelena, and Mary Margaret and David try to prove that they can be just as much fun as Hook is with Henry -- who thinks they are boring. Meanwhile, in Fairy Tale Land during the past year, an angry Ariel confronts Hook over her missing Prince Eric, who she assumes was kidnapped and possibly killed by the swarthy pirate. But when Hook confesses that the Jolly Roger has been stolen and Eric is most likely the thiefs prisoner, Ariel unknowingly provides him with a clue as to who the culprit is, and Hook  with Ariel in tow - goes off in search of his ship.', 'Y', 'N', 8.7),
	('Once Upon A Time', 'Bleeding Through', 3, 18, 'Yes', 'Yes', 'No', 20, 4, 2014, 'After Zelena steals Regina\'s heart, Regina casts a spell so that she can speak across the realms to her dead mother, Cora, to discover the truth about why she abandoned Zelena, and Belle stumbles across what Zelena\'s ultimate end game is. Meanwhile, in the Fairy Tale Land that was, young Cora is duped by a man claiming to be a prince and finds herself alone and pregnant. But a chance meeting with a real prince could lead Cora to the royal life she\'s always craved, but she must keep her pregnancy a secret or risk losing everything.', 'Y', 'N', 8.8),
	('Once Upon A Time', 'A Curious Thing', 3, 19, 'Yes', 'Yes', 'No', 27, 4, 2014, 'Zelena threatens to kill Henry if Hook - whose lips have been cursed by the Wicked Witch -- doesn\'t proceed with kissing Emma, which will drain all of her magical powers away, and things begin to heat up between Regina and Robin Hood. Meanwhile, back in the Fairy Tale Land that was during the past year, Snow and Charming go in search of Glinda, The Good Witch of the South, to see if she can help them defeat Zelena, and the curse that will ultimately send the Fairy Tale characters back to Storybrooke is cast -- but from an unlikely source.', 'Y', 'N', 8.9),
	('Once Upon A Time', 'Kansas', 3, 20, 'Yes', 'Yes', 'No', 4, 5, 2014, 'With Mary Margaret in labor and due to give birth at any moment, the residents of Storybrooke go on high alert in an attempt to ensure that Zelena doesn\'t try to steal her newborn baby for use in her ultimate game plan to turn back time and change her destiny - while obliterating Regina\'s existence. Meanwhile, in the land of Oz of the past, Glinda tries to convince Zelena to fight her evil tendencies and join her and her sister witches as a protector of Oz. But the appearance of a young girl from Kansas could turn out to be her undoing.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'Snow Drifts', 3, 21, 'Yes', 'Yes', 'No', 11, 5, 2014, 'While Mary Margaret and David celebrate the naming of their son at a coronation in Granny\'s Diner, Emma and Hook are pulled into Zelena\'s time portal and find themselves in the Enchanted Forest of the past. But in their quest to discover a way back, they must be careful not to change ANYTHING or risk altering the lives of their friends and family - as well as their very own existence.', 'Y', 'N', 9.3),
	('Once Upon A Time', 'There\'s No Place Like Home', 3, 22, 'Yes', 'Yes', 'No', 11, 5, 2014, 'In the conclusion of two-part episode that serves as the season three finale, Emma and Hook must find a way to return to Storybrooke, but in their quest to return, they have to find a way not to interfere or tamper with the events that lead up to the first curse, or else they risk altering the entire timeline, and could end up warping the future existence of everyone involved, including Emma, Hook, as well as Emma\'s family back in present-day Storybrooke.', 'Y', 'N', 9.5),
	('Once Upon A Time', 'A Tale Of Two Sisters', 4, 1, 'Yes', 'Yes', 'Yes', 28, 9, 2014, 'A scared and confused Elsa from Arendelle finds herself in Storybrooke and creates a powerful snow monster for protection. Regina wonders if her relationship with Robin Hood has been completely quashed now that Marian\'s back in the picture. Elsa\'s sister wants to complete their parent\'s fateful journey and discover if their quest may have held the secret to containing Elsa\'s out of control ice powers.', 'Y', 'N', 8.7),
	('Once Upon A Time', 'White Out', 4, 2, 'Yes', 'Yes', 'Yes', 5, 10, 2014, 'While desperately trying to find her sister Anna, Elsa accidentally traps them both inside an ice cave. Regina secludes herself from the town and Henry. With the townspeople considering Mary Margaret their leader, she faces her first leadership task in trying to re-start a generator and restore the towns electricity after Elsa freezes and damages the power lines. Anna tries to teach a meek David to fight Bo Peep.', 'Y', 'N', 8.4),
	('Once Upon A Time', 'Rocky Road', 4, 3, 'Yes', 'Yes', 'Yes', 12, 10, 2014, 'When an icy spell is cast on Marian,  the Storybrooke residents place the blame on Elsa. Emma and David find former Merry Men member Will Scarlet rummaging through Robin Hoods tent. Regina teams up with Henry to try and discover the identity of the author of the fairy tale book. Mary Margaret has trouble balancing her duties as leader of Storybrooke and mother to young Prince Neal. Hook begins to suspect that Mr. Gold is still in control of the dagger that calls upon him to be the Dark One. Elsa and Kristoff set off to stop Hans from attempting to take control of the kingdom.', 'Y', 'N', 8.4),
	('Once Upon A Time', 'The Apprentice', 4, 4, 'Yes', 'Yes', 'Yes', 19, 10, 2014, 'After Emma asks Hook out on a real first date, Hook visits Mr. Gold and asks for his hand to be reattached so that he can embrace her with both hands. Henry and Mary Margaret try to offer hope to Regina when she becomes frustrated over not being able to find a cure to save a frozen Marian. Will Scarlet attempts to break into the Storybrooke library to find a special book. Rumplestiltskin seeks a magical box that the Sorcerers apprentice is guarding.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'Breaking Glass', 4, 5, 'Yes', 'Yes', 'Yes', 26, 10, 2014, 'Regina reluctantly teams up with Emma to search for the Snow Queen after Sidney, who is once again Regina\'s prisoner in the mirror, discovers her whereabouts and agrees to lead her to the location. With Belle babysitting baby Neal, a nervous Mary Margaret and David prepare for their first date night away from their child and find themselves on a mission to track down Will Scarlet, who has escaped from the town jail. Elsa sees Anna in the Storybrooke woods. Young Emma finds herself a kindred spirit when she befriends a girl who, like her, is a runaway orphan.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'Family Business', 4, 6, 'Yes', 'Yes', 'Yes', 2, 11, 2014, 'The race is on to track down the elusive Snow Queen in order to discover her ultimate end-game. Unaware that she does not possess the real blade that controls The Dark One, Belle attempts to use it to get her reluctant husband to show her where the Snow Queen is hiding. Belle travels to Arendelle and seeks out Grand Pabbie to help her regain her lost memories.', 'Y', 'N', 8.2),
	('Once Upon A Time', 'The Snow Queen', 4, 7, 'Yes', 'Yes', 'Yes', 9, 11, 2014, 'Emma captures the Snow Queen and interrogates her at the sheriffs station. Regina and Robin Hoods relationship grows increasingly complex as they struggle to find a way to save his dying wife. Emma begins to see what she missed out on by not growing up and being a family with Snow and Charming. Henry begins his after-school job in Golds shop while trying to help Regina find a clue to the identity of the author of the storybook. The history of the Snow Queen is revealed.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'Smash The Mirror - 1', 4, 8, 'Yes', 'Yes', 'Yes', 16, 11, 2014, 'When the Snow Queen tries to pit Elsa and Anna against each other, it proves more difficult than she anticipated. Emmas powers are out of control and her fear of hurting loved ones pushes her away from everyone she cares about. Regina struggles with her plan to find the author of the storybook until her quest takes an unexpected turn. Robin Hood recruits Will Scarlet to assist him on a mission. Mary Margaret and David search for Emma.', 'Y', 'N', 8.8),
	('Once Upon A Time', 'Smash The Mirror - 2', 4, 9, 'Yes', 'Yes', 'Yes', 16, 11, 2014, 'When the Snow Queen tries to pit Elsa and Anna against each other, it proves more difficult than she anticipated. Emmas powers are out of control and her fear of hurting loved ones pushes her away from everyone she cares about. Regina struggles with her plan to find the author of the storybook until her quest takes an unexpected turn. Robin Hood recruits Will Scarlet to assist him on a mission. Mary Margaret and David search for Emma.', 'Y', 'N', 8.7),
	('Once Upon A Time', 'Fall', 4, 10, 'Yes', 'Yes', 'Yes', 30, 11, 2014, 'As the Spell of Shattered Sight approaches Storybrooke, Mary Margaret and David rally the residents to prepare for the curse while Belle and the fairies work together on an antidote. Gold, with Hook as his reluctant servant, sets about an exit strategy of his own. Regina and Robin Hood ready themselves for the worst while, with the help of a locator spell, Emma and Elsa search desperately for Anna. In Arendelle, Anna and Kristoff awaken to find that their kingdom is once again in danger.', 'Y', 'N', 9),
	('Once Upon A Time', 'Shattered Sight', 4, 11, 'Yes', 'Yes', 'Yes', 7, 12, 2015, 'Storybrooke is in a state of chaos with all the residents under the Snow Queens Spell of Shattered Sight at each others throats. Emma and Elsa race against the clock to free themselves of the ribbons and take down the Snow Queen and her curse. David can only watch when Regina clashes with Mary Margaret in an epic battle. Meanwhile, Gold gathers Belle and Henry as he prepares to leave town forever, and Will Scarlet looks to square his tab with Hook. Kristoffs thick-headedness leads Anna to a heartwarming discovery.', 'Y', 'N', 8.7),
	('Once Upon A Time', 'Heroes And Villains', 4, 12, 'Yes', 'Yes', 'Yes', 14, 12, 2015, 'In the aftermath of the Snow Queens spell, our heroes try to pick up the pieces and Regina has to make a difficult choice. Hooks fate hangs in the balance as Golds quest for power threatens everything he holds dear. And, in the Enchanted Forest flashback, an intrusion during Belle\'s stay at Rumplestiltskin\'s dark castle will wreak havoc in both the past and the future.', 'Y', 'N', 8.8),
	('Once Upon A Time', 'Darkness On The Edge Of Town', 4, 13, 'Yes', 'Yes', 'Yes', 1, 3, 2015, 'With Gold banished from town, the residents of Storybrooke attempt to resume their normal lives. Hook and Belle search for a way to release the fairies from the Sorcerer\'s hat, while Emma, Henry and Regina continue to look for clues that could lead them to the Author. But when a terrifying darkness descends on the town, Emma and Regina are forced to confront the true nature of evil. Meanwhile, in New York, Gold and Ursula enlist Cruella De Vil to join their cause.', 'Y', 'N', 8.4),
	('Once Upon A Time', 'Unforgiven', 4, 14, 'Yes', 'Yes', 'Yes', 8, 3, 2015, 'David and Mary Margaret suspect Cruella and Ursula have come to Storybrooke looking for something more than their own happy endings - something that threatens to reveal a secret they thought was long buried. Emma begins her own investigation of Cruella and Ursula, but she can\'t shake the feeling that her friends and family are keeping something from her. Regina and Henry continue their search for the Author, turning to Pinocchio and Marco in the hope Pinocchio might remember a clue that will help them. Meanwhile, in a flashback to Fairy Tale Land, Snow and Charming cross paths with the Queens of Darkness as the threat of the Evil Queen\'s Dark Curse hangs over all of them.', 'Y', 'N', 8.2),
	('Once Upon A Time', 'Enter The Dragon', 4, 15, 'Yes', 'Yes', 'Yes', 15, 3, 2015, 'In order to infiltrate the Queens of Darkness as a spy for the heroes, Regina must prove she\'s still willing to get her hands dirty. Meanwhile, Emma, David and Mary Margaret scramble to keep tabs on their undercover operative. Hook requests an unusual favor from Belle as Henry makes progress on his search for the Author. In a Fairy Tale Land flashback, Regina befriends Maleficent and helps her to rekindle her lost spark.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'Poor Unfortunate Soul', 4, 16, 'Yes', 'Yes', 'Yes', 22, 3, 2015, 'Hook leverages his complicated history with Ursula to find out what she knows about Gold\'s endgame. Gold and the Queens of Darkness torture August for information about the Author as Emma, Mary Margaret and David race to find them. Regina grows concerned for Robin Hood\'s safety while she struggles to maintain her cover with the villains. In a Fairy Tale Land flashback, when a restless young Ursula enlists Hook\'s help to run away from home, she soon learns it isn\'t wise to trust a pirate.', 'Y', 'N', 8.4),
	('Once Upon A Time', 'Best Laid Plans', 4, 17, 'Yes', 'Yes', 'Yes', 29, 3, 2015, 'Hook tells Emma that her fate is at stake in Gold\'s plan while Regina leads the villains on a wild goose chase. Henry makes a breakthrough in his search to find the Author, but Mary Margaret and David need a moment to reconsider the best course of action. In a Fairy Tale Land flashback, Snow and Charming search for a way to ensure their child will grow-up to be a hero. When a traveling peddler directs them to visit a kindly old hermit, Snow and Charming are presented with a choice that could secure their child\'s goodness, but at a price that will haunt them for years to come on.', 'Y', 'N', 8.1),
	('Once Upon A Time', 'Heart Of Gold', 4, 18, 'Yes', 'Yes', 'Yes', 12, 4, 2015, 'Emma is still reeling after learning the truth of her parents\' history with Maleficent, but she must focus on finding the Author, who is running loose in Storybrooke, before Gold does. When Gold\'s quest for his happy ending grows more urgent, he blackmails Regina into helping him. In a Fairy Tale Land flashback, Robin Hood learns what it means to be an honorable thief when he accepts a proposition by Rumpelstiltskin to travel to Oz to steal a valuable magic elixir from the Wicked Witch.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'Sympathy For The De Vil', 4, 19, 'Yes', 'Yes', 'Yes', 19, 4, 2015, 'In fictional 1920s England, viewers meet a young Cruella, whose oppressive mother uses her Dalmatians to terrorize her daughter. Cruella is confined to her mother\'s attic until a mysterious stranger arrives and empowers her to challenge her captor. In Storybrooke, Regina gains leverage to keep Gold from interfering with her plan to rescue Robin, but her trip to New York takes the backseat when she and Emma learn that Cruella has kidnapped Henry.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'Lily', 4, 20, 'Yes', 'Yes', 'Yes', 26, 4, 2015, 'Emma\'s potential for darkness is looming over everyone, but when Emma realizes Maleficent\'s daughter Lily is in fact her closest friend from her foster care days, she resolves to find Lily and reunite her with her mother. Regina joins forces with Emma and together they set out to track down Lily and to warn Robin about Zelena. However, neither of them is prepared for the harsh realities they\'ll encounter in the outside world. Meanwhile, in Storybrooke, Gold faces a crisis involving Belle. In a foster care flashback, things are looking up for young Emma with her new family until Lily\'s appearance threatens to destabilize everything.', 'Y', 'N', 8.2),
	('Once Upon A Time', 'Mother', 4, 21, 'Yes', 'Yes', 'Yes', 3, 5, 2015, 'Emma returns to Storybrooke to reunite Lily with Maleficent while Regina and Robin struggle to cope with the implications of Zelena\'s pregnancy. When Gold\'s health takes a turn for the worse, Isaac looks to a new ally for help procuring the magic ink he needs to re-write history. In a Fairy Tale Land flashback, Cora returns from Wonderland to beg Regina\'s forgiveness on the anniversary of Daniel\'s murder. Cora vows to help her daughter find true love, but Regina remains suspicious of her mother\'s intentions.', 'Y', 'N', 8.4),
	('Once Upon A Time', 'Operation Mongoose - 1', 4, 22, 'Yes', 'Yes', 'Yes', 10, 5, 2015, 'The Author proves to be a formidable wild card and forges an alliance with Gold. Emma, her parents, Hook and Regina scramble to stop them, but when Gold and the Author turn the tables on heroes and villains alike, the prospect of any happy outcome appears worlds away. Henry discovers he has big shoes to fill as he steps up to save his family before the story\'s final page is turned. It\'s a race to the finish, and everything culminates with a shocking twist that will leave the residents of Storybrooke reeling.', 'Y', 'N', 9.1),
	('Once Upon A Time', 'Operation Mongoose - 2', 4, 23, 'Yes', 'Yes', 'Yes', 10, 5, 2015, 'The Author proves to be a formidable wild card and forges an alliance with Gold. Emma, her parents, Hook and Regina scramble to stop them, but when Gold and the Author turn the tables on heroes and villains alike, the prospect of any happy outcome appears worlds away. Henry discovers he has big shoes to fill as he steps up to save his family before the story\'s final page is turned. It\'s a race to the finish, and everything culminates with a shocking twist that will leave the residents of Storybrooke reeling.', 'Y', 'N', 9.3),
	('Once Upon A Time', 'The Dark Swan', 5, 1, 'Yes', 'Yes', 'No', 27, 9, 2015, 'Immediately after becoming the Dark One, Emma disappears and the heroes must band together to save her, but first they have to find her, which will require the help of an unlikely ally. Meanwhile, in the Enchanted Forest, Emma struggles to resist her dark urges as she searches for Merlin in the hope that he can stop her transformation. Along the way to Camelot, she gets help from the plucky and brave warrior princess Merida, as well as King Arthur and his Knights of the Round Table.', 'Y', 'N', 8.9),
	('Once Upon A Time', 'The Price', 5, 2, 'Yes', 'Yes', 'No', 4, 10, 2015, 'In an effort to protect Emma, Regina steps up in a surprising way that will test her mettle as a force for good. King Arthur and Queen Guinevere throw a royal ball to welcome the heroes to Camelot, but when the celebration takes a deadly turn, David and Robin must leap into action or lose a crucial asset in the fight to save Emma. Back in Storybrooke, Hook deploys a tried-and-true technique in hopes of bringing Emma back to the light while the heroes discover that some unexpected baggage has followed them home from Camelot.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'Siege Perilous', 5, 3, 'Yes', 'Yes', 'No', 11, 10, 2015, 'In Camelot, the heroes feverishly work to free Merlin. Determined to help Emma, David embarks on a quest to retrieve a magical relic that Regina could use to communicate with the imprisoned sorcerer, but, when David leaves, Arthur insists on joining him because the dangers ahead are greater than he can imagine. Meanwhile, Mary Margaret discovers the fate of her old friend Lancelot. Back in Storybrooke, Arthur seeks David\'s help to catch a thief who threatens the safety of the citizens of Camelot. Across town, Emma reaches out to a conflicted Hook as she sets about her plan to draw Excalibur from the stone.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'The Broken Kingdom', 5, 4, 'Yes', 'Yes', 'No', 18, 10, 2015, 'After receiving a cryptic warning from Lancelot about Arthur\'s intentions, Mary Margaret realizes Arthur may be the heroes\' biggest threat, but when she is unable to convince David of the danger, she takes matters into her own hands. Meanwhile, Hook\'s unwavering love for Emma provides a glimmer of hope in her struggle against the unrelenting voice of Rumplestiltskin. In a Camelot flashback, Guinevere senses that Arthur is losing his way, consumed by his obsession with making Excalibur whole, so she sets out with Lancelot on her own quest into the heart of darkness. In Storybrooke, Dark Emma unleashes a secret weapon in the next phase of her plan to find the brave soul she needs to draw Excalibur from the stone.', 'Y', 'N', 8.2),
	('Once Upon A Time', 'Dreamcatcher', 5, 5, 'Yes', 'Yes', 'No', 25, 10, 2015, 'In Camelot, as Mary Margaret and David attempt to retrieve the Dark One dagger, Emma uses a Dreamcatcher to look into the past to see how Merlin was transformed into a tree. Together, Emma and Regina figure out the critical ingredient they must acquire to free Merlin, but it\'s a race against Arthur, who does not want Merlin released. Meanwhile, with encouragement from his moms, Henry musters up the courage to ask Violet on a date. Back in Storybrooke, the heroes break into Emma\'s house hoping to locate Gold, but what they find will give them a glimpse of Emma\'s end game. Far from prying eyes, Merida sets about the mission Emma has tasked her with and begins molding Gold into the hero they need to draw Excalibur.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'The Bear And The Bow', 5, 6, 'Yes', 'Yes', 'No', 1, 11, 2015, 'In a Camelot flashback, a chance encounter with Merlin, David, Hook, and Belle gives Merida new hope in her quest to save her brothers from the usurping clans of DunBroch. Unwilling to leave anything up to fate, Merida takes Belle along on a dangerous journey that culminates with an invaluable lesson in bravery. In Storybrooke, Regina, Mary Margaret, and David discover the spell that would allow one of Merlin\'s chosen to communicate with him, but when Arthur fails to reach the missing sorcerer, the heroes grow suspicious. Meanwhile, Emma commands Merida to kill Belle in hopes of forcing Mr. Gold\'s heroic transformation. With Merida unable to disobey Emma\'s orders, Gold must find the courage to fight for Belle\'s life or risk losing her forever.', 'Y', 'N', 8.2),
	('Once Upon A Time', 'Nimue', 5, 7, 'Yes', 'Yes', 'No', 8, 11, 2015, 'In Camelot, Merlin spearheads a mission to reunite the dagger with Excalibur so he can use the weapon to save Emma from the darkness threatening her soul. With Zelena in tow, Hook, Mary Margaret, David, Regina and Robin steal into Arthur\'s castle to take the broken sword from the maniacal king. Meanwhile, Merlin brings Emma along on a journey to confront his ancient nemesis and retrieve the sacred spark he\'ll need to reforge Excalibur. Both parties are tested, but one suffers a blow that could derail the entire operation. In a flashback to long before the Age of Arthur, young Merlin finds purpose after he is blessed with magic and immortality, but when he falls in love with a young refugee named Nimue, everything changes for Merlin, as their romance starts a chain of events that touches every one of our present day heroes.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'Birth', 5, 8, 'Yes', 'Yes', 'No', 15, 11, 2015, 'Tensions in Camelot come to a head when Merlin, now under Arthur\'s control, delivers an ultimatum to Emma: hand over the Dark One dagger and the Promethean spark or he will kill her entire family. Refusing to give in, Emma and our heroes face off against Arthur, Merlin and Zelena in an epic battle of magic and will. Just when the end is in sight, Emma is forced to make a gut-wrenching choice that no one saw coming. Back in Storybrooke, Zelena\'s pregnancy mysteriously accelerates and Hook goes to new and desperate lengths to get answers from the Dark Swan.', 'Y', 'N', 9),
	('Once Upon A Time', 'The Bear King', 5, 9, 'Yes', 'Yes', 'No', 15, 11, 2015, 'Zelena and Arthur journey to DunBroch on a mission to retrieve an enchanted relic that will provide the advantage they need to vanquish Emma and our heroes. Their path will cross with Merida\'s, who is on a journey of her own to pay a debt that her father, King Fergus, owed to the Witch when he died. Merida enlists the help of two friends, Mulan and Ruby, but, in order to satisfy the Witch and save DunBroch, she first must discover the identity of the knight who killed her father. In flashbacks, Merida learns about bravery and honor as she trains for combat and rides alongside Fergus into the infamous battle that claims his life.', 'Y', 'N', 8.1),
	('Once Upon A Time', 'Broken Heart', 5, 10, 'Yes', 'Yes', 'No', 29, 11, 2015, 'In a Camelot flashback, Hook becomes a Dark One and his lust for revenge against Rumplestilskin is re-ignited. When Emma and Hook disagree about their best course of action, the final pieces of the puzzle are revealed as events in Camelot catch up to the present and we witness a charged confrontation between the forces of light and dark that sends our heroes on a collision course with destiny. Meanwhile, in Storybrooke, Hook\'s centuries old lust for revenge against Gold puts both of their fates in jeopardy while Emma\'s love faces the ultimate test as she tries to convince Hook to turn away from the darkness before she, Mary-Margaret, David and Regina embark on a new mission as an unexpected evil is released.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'Swan Song', 5, 11, 'Yes', 'Yes', 'No', 6, 12, 2015, 'The dark siege of Storybrooke is underway as all of the resurrected Dark Ones target a living soul for sacrifice so that they can return to the realm of the living. With doom imminent, Gold advises Mary Margaret, David and the rest of the heroes to spend their last fleeting moments enjoying the company of their loved ones. Emma, however, refuses to give up, knowing that she is responsible for righting all the poor choices she made as Dark One - there\'s only one problem, Dark Hook. When they face-off with the fate of Storybrooke at stake, Hook\'s actions will devastate Emma in a way no one saw coming. In a Fairy Tale Land flashback, the Evil Queen tests Hook\'s mettle by forcing him to confront a demon from his past before contracting him to dispatch one from hers.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'Souls Of The Departed', 5, 12, 'Yes', 'Yes', 'No', 6, 3, 2016, 'Emma, Regina, Mary Margaret, David, Robin, Henry and Gold arrive in the Underworld, on a mission to rescue Hook, only to discover that their search will be more difficult than they had anticipated. The inhabitants of the Underworld all souls with unfinished business and many with quite personal vendettas hound our heroes at every turn. Meanwhile, in an Enchanted Forest flashback, a familiar face from the Evil Queen\'s past returns to present Regina with the perfect birthday gift.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'Labor Of Love', 5, 13, 'Yes', 'Yes', 'No', 13, 3, 2016, 'In the Underworld, an escapee from Hades\' prison informs the heroes that Hook is being held captive. But before the heroes can rescue Hook, they must face a terrifying beast that guards the prison. Mary Margaret searches for an old childhood friend who knows how to defeat the monster. However, once reunited, she discovers that her friend is no longer the hero he once was. Meanwhile, in an Enchanted Forest flashback, a young Snow White struggles to preserve peace in her kingdom and must learn how to be a true hero if she wants to one day become queen.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'Devil\'s Due', 5, 14, 'Yes', 'Yes', 'No', 20, 3, 2016, 'Hook\'s captivity takes a dark turn when Hades threatens to condemn him to the River of Lost Souls after Hook refuses to choose which three of his friends will have to remain in the Underworld. Meanwhile, Gold is suddenly eager to help Emma, Snow, David, Regina, Robin, and Henry find Hook so he can return home to Belle; but in order to do so, he must find his ex-wife Milah in the Underworld and ask for her help. In Fairy Tale Land flashbacks, Rumple and Milah face a life-or-death crisis concerning their son, Baelfire, that forces Rumple to make a deal that will haunt him.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'The Brothers Jones', 5, 15, 'Yes', 'Yes', 'No', 27, 3, 2016, 'Finally reunited, Hook and Emma must find a way to defeat Hades so that they can return to Storybrooke with Snow, David, Regina, Robin, Henry and Gold. A surprise visit from Hook\'s departed brother Liam just might provide the lead they were looking for others who have tried to overthrow Hades spoke of a book that contained the key to his downfall. Tired of watching from the sidelines, Henry secretly takes matters into his own hands while the others search for the book. Meanwhile, Hades redoubles his efforts to trap the heroes in the Underworld by playing them against one another. In flashbacks, the bond between the two young Jones brothers is tested and strengthened on a merchant ship heading into a dangerous storm.', 'Y', 'N', 8.1),
	('Once Upon A Time', 'Our Decay', 5, 16, 'Yes', 'Yes', 'No', 3, 4, 2016, 'Emma, Snow, David, Regina, Robin, Henry and Hook continue to search for a way to free everyone from the Underworld. At the mercy of Hades, Gold creates a portal to Storybrooke, which transports Belle, Zelena and Baby Hood to the Underworld. While Zelena and Regina get into a sibling squabble, Belle is reunited with Rumple only to learn some tremendously shocking news that will change her life forever. Meanwhile, Snow and David hopelessly attempt to send a message from the Underworld to their son, Neal. In flashbacks, Hades learns about Zelena\'s very special spell and pays her a visit in Oz with the intention of striking an alliance, but finds himself with more than just a partner in crime.', 'Y', 'N', 8.3),
	('Once Upon A Time', 'Her Handsome Hero', 5, 17, 'Yes', 'Yes', 'No', 10, 4, 2016, 'Belle turns to Rumplestiltskin with hope of finding a way to protect their child from Hades. However, they disagree over whether to use dark magic, as Belle forbids Rumplestiltskin from using his powers for evil. Meanwhile, Hades secretly meets with Gaston in the Underworld and encourages him to seek revenge on Rumplestiltskin. As the heroes try to find a way to defeat Hades, Emma has a terrifying nightmare that she realizes is beginning to come true. And in flashbacks, Belle and Gaston meet for the first time, but their blossoming romance comes to a halt on the eve of the Ogre wars.', 'Y', 'N', 8),
	('Once Upon A Time', 'Ruby Slippers', 5, 18, 'Yes', 'Yes', 'No', 17, 4, 2016, 'In flashbacks, Ruby and Mulan find themselves in Oz, where they meet Dorothy. After the three witness Zelena\'s return to Oz, they look for a way to defeat her once and for all. However, Dorothy mysteriously disappears, and Ruby\'s search for her new friend lands her in the Underworld. Reunited with the heroes, Ruby teams up with Emma, Regina and Snow to continue looking for Dorothy. Meanwhile, Snow and David struggle with not being able to be with their son, Neal, and devise a plan so that one of them can escape the Underworld.', 'Y', 'N', 6.9),
	('Once Upon A Time', 'Sisters', 5, 19, 'Yes', 'Yes', 'No', 24, 4, 2016, 'Now that Hades and Zelena are reunited, Hades tells Zelena that he wants a future with her outside of the Underworld. All she needs to do is heal his heart with True Love\'s Kiss so they can leave the Underworld and trap the heroes there for eternity. When Regina overhears of this plan, she enlists Cora\'s help to find a way to separate Zelena from Hades. However, Cora reveals a family secret that could change Regina and Zelena\'s lives forever. Meanwhile, David finally meets James, only to realize that his twin is determined to seek revenge on him for stealing the life he could have had.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'Firebird', 5, 20, 'Yes', 'Yes', 'No', 1, 5, 2016, 'Hades turns to the heroes to ask for help with getting Zelena back from Rumplestiltskin and Peter Pan. In return, he offers to take all their names off their tombstones. However, when Hook is still unable to leave, he and Emma must journey into the depths of the Underworld. Meanwhile, Cruella De Vil is determined to keep the heroes trapped in the Underworld. In flashbacks, Emma searches for answers about her family and makes an unexpected friendship.', 'Y', 'N', 8.6),
	('Once Upon A Time', 'Last Rites', 5, 21, 'Yes', 'Yes', 'No', 8, 5, 2016, 'Emma, David, Regina, Robin and Henry are finally back home in Storybrooke and reunited with Snow, but, unfortunately, they still have to contend with Hades, who continues to deceive Zelena as he lays out his plan to use the all-powerful Olympian Crystal to take over the town. The heroes desperately search for a way to defeat Hades while Hook does the same in the Underworld, looking for those missing storybook pages. Regina and Robin take a more direct approach, which culminates in an epic showdown that will leave our heroes forever changed.', 'Y', 'N', 8.7),
	('Once Upon A Time', 'Only You', 5, 22, 'Yes', 'Yes', 'No', 15, 5, 2016, 'Regina reels from the death of Robin Hood, and everyone tries to give her room to grieve, but when the heroes discover Gold has stolen Hades Olympian Crystal and tethered all of Storybrookes magic to it, they set out to stop him. Henry decides he no longer can stand all the pain magic has caused his family, so he goes rogue, with Violet in tow, to destroy magic once and for all. Meanwhile, Zelena, Snow, David, and Hook attempt to open a portal that will return Merida and the other Storybrooke guests to their homes, but things go awry, and the group winds up in a deranged new world.', 'Y', 'N', 8.5),
	('Once Upon A Time', 'An Untold Story', 5, 23, 'Yes', 'Yes', 'No', 15, 5, 2016, 'With the possibility of magic being destroyed and the fate of Storybrooke hanging in the balance, its a race for Emma and Regina to track down Henry before Gold can find him first. Regina continues to struggle with her frustrations over her former evil-self and, elsewhere, Snow, David, Hook, and Zelena are imprisoned and must contend with two very disturbed individuals that may give Gold a run for his money.', 'Y', 'N', 8.6),
	('Once Upon a Time', 'The Savior', 6, 1, 'No', 'No', 'No', 25, 9, 2016, 'Our heroes set out to stop Hyde, Emma develops a mysterious side effect, and Storybrooke becomes a haven for refugees from the Land of Untold Stories. Meanwhile, Regina and Zelena embrace their newfound sisterhood by becoming roommates, while Rumple tries to free Belle from the sleeping Curse with the help of a stranger. In flashback, Jafar confronts an afflicted Aladdin in Agrabah, and a secret about the Savior is revealed.', 'N', 'N', 0),
	('Once Upon a Time', 'A Bitter Draught', 6, 2, 'No', 'No', 'No', 2, 10, 2016, 'When a mysterious man from the Land of Untold Stories, who has a past with the Evil Queen, arrives in Storybrooke, David and Snow work together with Regina to neutralize the threat. Belle seeks Hooks help finding a safe place to hide away from her husband, Mr. Gold. The Evil Queen continues to try to win Zelena over to her side, while Emma resumes her therapy sessions with Archie and shares her terrifying vision of the future.', 'N', 'N', 0),
	('Once Upon a Time', 'The Other Shoe', 6, 3, 'No', 'No', 'No', 9, 10, 2016, 'As Storybrooke continues to welcome the new arrivals from the Land of Untold Stories, families, friends and even long-lost enemies are reunited once again. When Ashley (Cinderella) searches for her step-family, intent on settling their unfinished business, Emma, Hook and Henry scramble to help her before its too late. Meanwhile, Regina attempts to bribe Mr. Hyde for information about how to defeat the Evil Queen and Snow helps Dr. Jekyll find a suitable laboratory for his work. David makes a deal with Gold and delivers a message to Belle in exchange for new information about his father. In a flashback, Cinderella attends a ball and meets her prince', 'N', 'N', 0),
	('Once Upon a Time', 'Strange Case', 6, 4, 'No', 'No', 'No', 16, 10, 2016, 'The Evil Queen and Hyde continue on their quest to steal Dr. Jekylls serum; Snow looks forward to her first day back as a school teacher; and while Emma looks forward to Hook moving in with her, Hook finds himself trying to protect Belle from Mr. Gold, who has made sure she cant leave the confines of the pirate ship. Meanwhile, back in the past, Rumplestiltskin helps Dr. Jekyll complete his serum to separate a mans personality into two  good and evil  but his help comes with a hefty price.', 'N', 'N', 0),
	('Once Upon a Time', 'Street Rats', 6, 5, 'No', 'No', 'No', 23, 10, 2016, 'In a flashback to Agrabah, Princess Jasmine recruits Aladdin to help her recover a secret weapon capable of breaking Jafar\'s hold on the Sultan and saving the city from ruin. Their quest takes them to the Cave of Wonders where Aladdin\'s fate is revealed. In Storybrooke, the Evil Queen tricks Hook and the Charmings and forces Emma to reveal her secret in an effort to divide the family. While the Evil Queen pampers Zelena, elsewhere in town, Regina and our heroes scramble to learn what became of Aladdin.', 'N', 'N', 0),
	('Once Upon a Time', 'Dark Waters', 6, 6, 'No', 'No', 'No', 30, 10, 2016, 'Emma tries to convince Aladdin to work with Jasmine to help Agrabah, while Regina teams up with Snow and David to free Archie from Zelena. The Evil Queen sows suspicion between Henry and Hook, even as Mr. Gold reminds her of his most important lesson. Meanwhile, in the past, Hook finds himself kidnapped by the mysterious Captain Nemo and held captive inside his legendary submarine, the Nautilus.', 'N', 'N', 0),
	('Once Upon a Time', 'Heartless', 6, 7, 'No', 'No', 'No', 6, 11, 2016, 'In a flashback to the Enchanted Forest, Bandit Snow dodges a bounty hunter known as the Woodcutter while shepherd David goes on a fateful journey to sell his familys farm. In Storybrooke, the Evil Queen threatens to destroy the town and everyone in it unless Snow and David surrender their hearts. As Emma, Hook and Henry prepare to defend Storybrooke, Snow, David and Regina search for a magical sapling created by the first spark of true love. Regina uses Golds and the Evil Queens burgeoning romance against them, and Zelena offers Belle some friendly advice.', 'N', 'N', 0),
	('Once Upon a Time', 'I\'ll Be Your Mirror', 6, 8, 'No', 'No', 'No', 13, 11, 2016, 'Emma and Regina formulate a plan to trap the Evil Queen in a prison of their own making, while Snow and David adjust to life without each other. As Henry nervously prepares to take Violet to the school dance, the Evil Queen impersonates Regina to give him some advice that could lead him down a dark path. Meanwhile, Zelena agrees to help Belle, and together they enlist Aladdin to steal a magical object from Mr. Gold that could protect Belle and her unborn child from him forever.', 'N', 'N', 0),
	('Once Upon a Time', 'Changelings', 6, 9, 'No', 'No', 'No', 27, 11, 2016, 'In a Fairy Tale Land flashback, Rumple collects Jack and Jill\'s son as bait to lure a powerful being to him. Back in Storybrooke, Gold tells the Evil Queen that she must kill Zelena, and the EQ makes a decision that will change her relationship with her sister forever. When Belle discovers Gold\'s plans for their son, she convinces Hook and Emma to help her steal squid ink that can immobilize him, and, as a result, Belle is left to make a sacrifice that will affect the lives of everyone in Storybrooke. Meanwhile, Jasmine finds a genie-less lamp that she hopes to use to save Agrabah, and Aladdin finds a way to be her hero.', 'N', 'N', 0),
	('Once Upon a Time', 'Wish You Were Here', 6, 10, 'No', 'No', 'No', 4, 12, 2016, 'When she learns that our heroes possess a weapon capable of defeating her, the Evil Queen steals Aladdins magic lamp from Jasmine and makes a wish that could sideline the Savior forever. Unwilling to wake Snow while Emma is missing, David works with Hook and Henry to hold the Evil Queen at bay in Storybrooke, as Regina goes on a rogue rescue mission. Meanwhile, Gold and Belle face a surprising danger to their newborn son.', 'N', 'N', 0),
	('Once Upon a Time', 'Tougher Than The Rest', 6, 11, 'No', 'No', 'No', 5, 3, 2017, 'With Snow still asleep in Storybrooke, David and Hook race to stop Gideon before he can confront Emma. Gideon makes a startling confession to Belle and Gold about his whereabouts while he was missing. Meanwhile, Regina struggles with the realization that everyone, perhaps even Robin, is better off in the alternate world where the Evil Queen was defeated. And when Emma inspires a familiar face to help her and Regina return home, she discovers the power to change her fate.', 'N', 'N', 0),
	('Once Upon a Time', 'Murder Most Foul', 6, 12, 'No', 'No', 'No', 12, 3, 2017, 'Before Hook takes the next step in his relationship with Emma, he wants to make sure David sees him as more than just a pirate. So when David asks Hook to help him uncover the truth about his fathers death, Hook agrees. Meanwhile, Regina works to acclimate Robin to life in Storybrooke, but soon discovers he has a dark side that makes the task much more complicated than she anticipated.', 'N', 'N', 0),
	('Once Upon a Time', 'Ill-Boding Patterns', 6, 13, 'No', 'No', 'No', 19, 3, 2017, 'When Gideon resumes his mission to kill Emma and become the Savior, Mr. Gold steps in to ensure that the use of dark magic does not poison his son. Meanwhile, Robin proves willing to ally himself with anyone offering the possibility of escape from Regina and Storybrooke. Hook gathers the courage to come clean to Emma, but not before she discovers he\'s been keeping a secret. And in a flashback to Fairy Tale Land, the legendary folk hero Beowulf sets his sights on Rumplestiltskin after the Dark One uses his powers to defeat the ogres and win the war for humanity.', 'N', 'N', 0),
	('Once Upon a Time', 'Page 23', 6, 14, 'No', 'No', 'No', 26, 3, 2017, 'Believing there isn\'t room in Storybrooke for both her and Regina, the Evil Queen sets out to eliminate her other half using Robin to bait the trap. Hook, determined to make things work with Emma, turns to his old friend Capt. Nemo for advice, but Gideon torpedoes his plan before he\'s able to set things right. In a flashback to the Enchanted Forest, the Evil Queen learns a surprising lesson about the true source of her misery.', 'N', 'N', 0),
	('Once Upon a Time', 'A Wondrous Place', 6, 15, 'No', 'No', 'No', 2, 4, 2017, 'When Hook finds himself trapped in another realm along with the Nautilus and her crew, he races to return to Emma before Gideon can execute the rest of his plan. In Storybrooke, Regina and Snow take Emma out to get her mind off Hook\'s disappearance. And in a flashback to Agrabah, Jasmine befriends Ariel, and together they set out to locate Prince Eric as the threat from Jafar intensifies.', 'N', 'N', 0),
	('Once Upon a Time', 'Mother\'s Little Helper', 6, 16, 'No', 'No', 'No', 9, 4, 2017, 'Gold and Belle convince Emma to help Gideon, explaining that together they can stop the Black Fairy. Henry experiences a disorienting shift in his powers that forces Regina to seek counsel from the previous Author. Meanwhile, in Fairy Tale Land, Hook attempts to win the assistance of an old adversary by betting his most prized possession on a game of cards. And, in a flashback, the Black Fairy tortures young Gideon in hopes of molding him into the perfect apprentice.', 'N', 'N', 0),
	('Once Upon a Time', 'Awake', 6, 17, 'No', 'No', 'No', 16, 4, 2017, 'Still trapped in Neverland, Hook aligns himself with Tiger Lily, hoping to find a way back to Emma. Back in Storybook, Regina works to break the sleeping curse that David and Snow are under, and Gold denies The Black Fairy, which brings the two of them to a fearsome impasse. In flashbacks, we learn what Snow and Charming sacrificed in order for Emma to fulfill her destiny as the Savior.', 'N', 'N', 0),
	('Once Upon a Time', 'Where Bluebirds Fly', 6, 18, 'No', 'No', 'No', 23, 4, 2017, 'In flashback, Zelena befriends a young woodcutter who has been cursed and turns to her for help finding a new heart. Zelena is forced to choose between keeping her powers and her friendship with him. Meanwhile, in Storybrooke, Zelena decides to take on the Black Fairy and put a stop to her, once and for all, against Regina\'s wishes, and the Charmings disagree over Emma and Hook\'s wedding plans.', 'N', 'N', 0),
	('Once Upon a Time', 'The Black Fairy', 6, 19, 'No', 'No', 'No', 30, 4, 2017, 'In flashback, after Rumples mother, Fiona, learns from his fairy godmother that his destiny is prophesized, she does everything in her power to keep it from happening. Ultimately, Fiona will have to make a decision that will change the course of both their lives forever. Meanwhile in Storybrooke, Rumple faces a similar dilemma.', 'N', 'N', 0),
	('Once Upon a Time', 'The Song In Your Heart', 6, 20, 'No', 'No', 'No', 7, 5, 2017, 'In flashback, Snow and Charming make a special wish that Emma will be protected. The result of their wish has the whole kingdom bursting into song which infuriates the Evil Queen. Meanwhile in Storybrooke, the Black Fairy announces her plans to unleash another curse on the town while Emma and Hook prepare for their wedding.', 'N', 'N', 0),
	('Once Upon a Time', 'The Final Battle - 1', 6, 21, 'No', 'No', 'No', 14, 5, 2017, 'Henry awakens to a cursed Storybrooke and discovers Emma has been in the mental hospital, and the Black Fairy is the new mayor. Henry attempts to help Emma regain her memory while Gold tries to find out what has really happened to Belle. Meanwhile, Snow, Charming, Regina, Zelena and Hook are trapped in a crumbling Fairy Tale Land and desperately try to figure out a way to be reunited with Emma and Henry.', 'N', 'N', 0),
	('Once Upon a Time', 'The Final Battle - 2', 6, 22, 'No', 'No', 'No', 14, 5, 2017, 'Henry awakens to a cursed Storybrooke and discovers Emma has been in the mental hospital, and the Black Fairy is the new mayor. Henry attempts to help Emma regain her memory while Gold tries to find out what has really happened to Belle. Meanwhile, Snow, Charming, Regina, Zelena and Hook are trapped in a crumbling Fairy Tale Land and desperately try to figure out a way to be reunited with Emma and Henry.', 'N', 'N', 0),
	('Quantico', 'Run', 1, 1, 'Yes', 'Yes', 'No', 27, 9, 2015, 'A diverse group of recruits has arrived at the FBI Quantico Base for training. They are the best, the brightest and the most vetted, so it seems impossible that one of them is suspected of masterminding the biggest attack on New York City since 9/11.', 'N', 'N', 7.7),
	('Quantico', 'America', 1, 2, 'Yes', 'Yes', 'No', 4, 10, 2015, 'Alex is on the run and must outsmart Liam and his team to get into her apartment for anything that could help clear her name. Meanwhile, in a flashback to Quantico training, the NATS are tasked with finding a needle in a haystack while looking for potential threats to national security.', 'N', 'N', 7.5),
	('Quantico', 'Cover', 1, 3, 'Yes', 'Yes', 'No', 11, 10, 2015, 'At Quantico, Alex finally receives information about her father and his FBI past, but in the future its her mother, Sita, who plays a key role when Liam convinces her to participate in a press conference on national television begging Alex to turn herself in. Also at Quantico, the NATS learn the art of profiling and focus on their classmates strengths and weaknesses, ultimately challenging their confidence and comradery.', 'N', 'N', 7.3),
	('Quantico', 'Kill', 1, 4, 'Yes', 'Yes', 'No', 18, 10, 2015, 'At Quantico, the recruits are tasked with performing a hostage rescue training exercise that shakes Alex, making her question her ability and whether she should quit Quantico. While in the future, Alex continues to search for clues, finding one that questions the innocence of one of her closest classmates. But is her clue really what she thinks? No one is who they seem.', 'N', 'N', 7.2),
	('Quantico', 'Found', 1, 5, 'Yes', 'Yes', 'No', 25, 10, 2015, 'The trainees leave campus for the first time while undergoing their first undercover assignment. With an evening full of unpredictable events, Alex and Ryan find themselves getting close while the recruits skills are tested. In the future, Alex decides to tell her side of the story and sits down for her first public interview leaving everyone watching to wonder who is really telling the truth.', 'N', 'N', 7.1),
	('Quantico', 'God', 1, 6, 'Yes', 'Yes', 'No', 1, 11, 2015, 'The NATs learn surveillance by putting it into practice with Miranda and her troubled son, Charlie. Shelby tries to keep Caleb at a distance, but Raina opens the door to a closer relationship with Simon. In the future, Alex is helped when she tries to hack into an FBI computer.', 'N', 'N', 7),
	('Quantico', 'Go', 1, 7, 'Yes', 'Yes', 'No', 8, 11, 2015, 'Its midterm exam time at Quantico where the NATS are given an explosive assignment which results in some people going home for good. In the future, Alex continues to try and clear her name, finding Nimah and Raina who provide more questions than answers leaving Alex and the world to wonder, who can you really trust?', 'N', 'N', 7),
	('Quantico', 'Over', 1, 8, 'Yes', 'Yes', 'No', 15, 11, 2015, 'In the future, the FBI computer system is hacked and confidential files go public leading Alex to the conclusion that a second bomb is in play somewhere in NYC. Back at Quantico, the recruits are given individual assignments only to realize they are all connected as part of a lesson to look at the bigger picture.', 'N', 'N', 6.9),
	('Quantico', 'Guilty', 1, 9, 'Yes', 'Yes', 'No', 29, 11, 2015, 'At Quantico, the NATS attend a class with guest speaker Dr. Susan Langdon. Dr. Langdon is a former agent and profiler who tasks the trainees with looking at serial killer cases to find the one victim that doesnt fit the case, but when Simon becomes too good at finding things that dont belong, its his life that becomes endangered. In the future, Alex is interrogated by a highly sophisticated FBI team while Ryans life hangs in the balance.', 'N', 'N', 7),
	('Quantico', 'Quantico', 1, 10, 'Yes', 'Yes', 'No', 6, 12, 2015, 'At Quantico, an emergency disciplinary hearing causes deep secrets to be spilled, while in the future Alex works covertly with her team to find the real bomber before her time runs out.', 'N', 'N', 6.8),
	('Quantico', 'Inside', 1, 11, 'Yes', 'Yes', 'No', 13, 12, 2015, 'The terrorists responsible for the bombing of Grand Central Station finally reveal themselves, but instead of answers, more questions remain. While back at Quantico, the recruits receive a well-deserved few days off for the holidays, but not everyone is oh so merry when secrets are revealed and lines and blurred.', 'N', 'N', 7.2),
	('Quantico', 'Alex', 1, 12, 'Yes', 'Yes', 'No', 6, 3, 2016, 'Alex finds herself in the middle of a congressional hearing to testify about the terrorist bombings. Convinced Elias didnt act alone, she is determined to find answers and the truth. While back at Quantico, a new group of NATS join Alex and her classmates, causing tension and competition between the groups of trainees.', 'N', 'N', 6.7),
	('Quantico', 'Clear', 1, 13, 'Yes', 'Yes', 'No', 13, 3, 2016, 'This week the NATS learn how to source information from confidential informants, but when they test their skills in the real world, they soon realize being an agent is not as easy as it seems. Meanwhile, in the future, Alex and a fellow agent find themselves in a life or death situation when they are forced to provide classified information that could result in deadly consequences.', 'N', 'N', 6.6),
	('Quantico', 'Answer', 1, 14, 'Yes', 'Yes', 'No', 20, 3, 2016, 'At Quantico, the NATS team up for defensive driving lessons while tensions between Liam and Drew explode, resulting in shocking admissions and consequences. In the future, Simon grapples with his new reality in the aftermath of whats transpired. Even though his friends try and help him, its uncertain he will ever be the same again.', 'N', 'N', 6.2),
	('Quantico', 'Turn', 1, 15, 'Yes', 'Yes', 'No', 27, 3, 2016, 'A terror cell tries to infiltrate Quantico, forcing Miranda and Liam to pay a deadly price. While in the future, Alex continues to get instructions from the terrorist  only this time, its Claire Haas life that hangs in the balance.', 'N', 'N', 6.6),
	('Quantico', 'Clue', 1, 16, 'Yes', 'Yes', 'No', 3, 4, 2016, 'A training exercise is too close to home for Shelby; in the future, Hannah becomes an Ally to Alex and tries to stop the terrorists from making another strike.', 'N', 'N', 6.3),
	('Quantico', 'Care', 1, 17, 'Yes', 'Yes', 'No', 10, 4, 2016, 'At Quantico, the NATS\' current assignment is to learn about human trafficking when Liam and Miranda challenge them to cross the U.S. / Canadian border without passports. Meanwhile, in the future, Simon continues to help Alex try to find the terrorist, but doing so puts his own life in great risk.', 'N', 'N', 6.5),
	('Quantico', 'Soon', 1, 18, 'Yes', 'Yes', 'No', 17, 4, 2016, 'At Quantico, the NATs look into each others background to determine who gets high- level security clearance, and in the process Alex, Shelby and Iris learn some surprising truths about Drew, Will and Caleb. Meanwhile, in the future, Alex contacts Claire Haas in order to find her missing friends and is shocked when she discovers what happened to Caleb.', 'N', 'N', 6.3),
	('Quantico', 'Fast', 1, 19, 'Yes', 'Yes', 'No', 24, 4, 2016, 'Its career day at Quantico as the NATS meet representatives from various FBI branches to help them decide their future paths. In the future, Alex continues to search for the terrorist, and in the process, discovers some familiar faces  including one who knows the terrorists endgame.', 'N', 'N', 6.2),
	('Quantico', 'Drive', 1, 20, 'Yes', 'Yes', 'No', 1, 5, 2016, 'With only a few weeks until graduation, the NATS are dispatched to various field offices where Alex and Ryan find themselves working a case together. Meanwhile, in the future, Shelby and Caleb\'s relationship takes a turn, and Alex doesn\'t know who to trust when she discovers new information about the man she loves.', 'N', 'N', 6.3),
	('Quantico', 'Right', 1, 21, 'Yes', 'Yes', 'No', 8, 5, 2016, 'The NATS are excited that graduation is near as they prepare to leave Quantico and head out into the real world for their new assignments. In the future, Alex learns someone she cared about at Quantico is not who they seemed to be, as she finds herself at the heart of another possible attack.', 'N', 'N', 6.8),
	('Quantico', 'Yes', 1, 22, 'Yes', 'Yes', 'No', 15, 5, 2016, 'It\'s graduation day for the NATS of Quantico, while, in the future, Alex and her team find themselves head-to-head with the terrorist.', 'N', 'N', 7.1),
	('Quantico', 'Kudove', 2, 1, 'No', 'No', 'No', 25, 9, 2016, 'While investigating the dark world of espionage at a mysterious CIA training facility, Alex becomes caught at the center of a conspiracy that threatens lives across the globe.', 'N', 'N', 6.4),
	('Quantico', 'Lipstick', 2, 2, 'No', 'No', 'No', 2, 10, 2016, 'New CIA recruits run counter-surveillance exercises at The Farm; in the future, Ryan and Raina try to thwart the terrorists\' plan to blend in with hostages', 'N', 'N', 6.1),
	('Quantico', 'Stescalade', 2, 3, 'No', 'No', 'No', 16, 10, 2016, 'The new CIA recruits continue training at The Farm; in the future, Alex infiltrates the terrorist group holding everyone hostage, and is shocked to learn not everyone is a stranger.', 'N', 'N', 5.9),
	('Quantico', 'Kubark', 2, 4, 'No', 'No', 'No', 23, 10, 2016, 'The trainees are put through a training drill that tests their stress levels while Alex tries to gather information and get close to Owen. Meanwhile, in the future, the terrorist organization demands a trade, a move that could possibly end the stand-off.', 'N', 'N', 5.8),
	('Quantico', 'Kmforget', 2, 5, 'No', 'No', 'No', 30, 10, 2016, 'At the Farm, Harry is still suspicious of Alex and Ryan, and hes determined to learn more about their plan, while Leon is recruited for a special assignment by Owen. Meanwhile, in the future, Alex continues to run from the terrorists but faces her toughest challenge yet when the terrorists corner her.', 'N', 'N', 5.8),
	('Quantico', 'Aquiline', 2, 6, 'No', 'No', 'No', 6, 11, 2016, 'At the Farm, the trainees learn their next task is to decide on a drone strike, which triggers Alexs memories of Simons sacrifice. Meanwhile, Shelby and Leons relationship reaches the next level, and Nimah advises Alex and Ryan not to trust Harry. In the future, Alex questions if she can trust Lydia, leading to combat between the two.', 'N', 'N', 5.5),
	('Quantico', 'Lcflutter', 2, 7, 'No', 'No', 'No', 13, 11, 2016, 'At the Farm, Owen teaches the trainees about enhanced interrogation techniques, and turns the tables on his students by putting himself in the hot seat. Meanwhile, Shelby goes undercover. In the future, a new president is sworn in, and Miranda makes a tough choice.', 'N', 'N', 5.7),
	('Quantico', 'Odenvy', 2, 8, 'No', 'No', 'No', 27, 11, 2016, 'At the Farm, Lydia and Owen teach the group about the necessity of lying and cutting off relationships. Perfect timing for Alex, since she is feeling disconnected from Ryan personally and professionally. In the future, Alex and company attempt to destroy the biological weapon.', 'N', 'N', 5.7),
	('Quantico', 'Cleopatra', 2, 9, 'No', 'No', 'No', 23, 1, 2017, 'The recruits are schooled in the art of seduction, which Alex sees as a perfect opportunity to get closer to Owen, but will it threatens her relationship with Ryan? And in the future, Alex finally gets the answers shes been looking for about who and what the terrorists are on.', 'N', 'N', 6.5),
	('Quantico', 'Jmpalm', 2, 10, 'No', 'No', 'No', 30, 1, 2017, 'At the Farm, Owen teaches the recruits a lesson on the necessity of betrayal, with a mission of getting the Venezuelan Consul Gabriel Carrera to turn on his country. In the future, Alex is forced to team up with Miranda in order to save the hostages, while President Claire Haas has a plan to end the crisis once and for all.', 'N', 'N', 6.6),
	('Quantico', 'Zrtorch', 2, 11, 'No', 'No', 'No', 6, 2, 2017, 'Alex tries to convince Owen of the traitor amongst them. The recruits are tasked with getting an asset out of Germany  but their target has a death wish. In the future, the terrorists resort to new means to gain information from the hostages.', 'N', 'N', 7.1),
	('Quantico', 'Fallenoracle', 2, 12, 'No', 'No', 'No', 13, 2, 2017, 'At the Farm, the recruits break into the NSA on a mission to delete all their personal information, but the rogue group within the CIA has other plans. In the future, the hostages strategize an escape via underground tunnels as a set-up to get the terrorists to reveal themselves.', 'N', 'N', 6.9),
	('Quantico', 'Epicshelter', 2, 13, 'No', 'No', 'No', 20, 2, 2017, 'The recruits learn how to burn everything down if they are ever exposed. Meanwhile, a mysterious death leads to an FBI investigation at the Farm. In the future, Alex heads back into the crisis zone and exposes the true traitor within the CIA.', 'N', 'N', 7),
	('Quantico', 'Lnwilt', 2, 14, 'No', 'No', 'No', 20, 3, 2017, 'In the wake of the G20 hostage crisis, President Claire Haas assembles an illegal and clandestine joint task force, bringing together Alex and her friends from both the FBI and CIA to unmask a global conspiracy.', 'N', 'N', 7),
	('Quantico', 'Mockingbird', 2, 15, 'No', 'No', 'No', 27, 3, 2017, 'While their newly appointed leader gets familiar with the team of CIA and FBI agents, Owen leads an investigation into the strange world of fake news. But hunting down the publishers of a fake story might lead to deadly consequences.', 'N', 'N', 7.2),
	('Quantico', 'Mktopaz', 2, 16, 'No', 'No', 'No', 3, 4, 2017, 'When Clay is forced to use his fiance to carry out an operation, the whole team reexamines their personal connections, or more accurately, the lack thereof. Meanwhile, Alex forges an unexpected bond with an asset at the center of a conspiracy, and Harry struggles to find his place on the task force.', 'N', 'N', 7),
	('Quantico', 'Odyoke', 2, 17, 'No', 'No', 'No', 10, 4, 2017, 'When one of Alexs friends is framed for a domestic terror attack, they turn to her for help. With an upcoming vote in the House for a Muslim registry bill, the task force realizes this attack isnt a coincidence. The Collaborators are actively stirring fear to pass the registry, and our team heads to the Hill to turn the votes. Meanwhile, Alex and Owen track down an assassin.', 'N', 'N', 6.8),
	('Quantico', 'Kumonk', 2, 18, 'No', 'No', 'No', 17, 4, 2017, 'A despondent Clay meets with the President to discuss the future of the task force, but hes interrupted by the arrival of his brother. Meanwhile, Alex leads an operation to expose the collaborators plans to sink the Presidents reputation, and she teaches Owen to trust his instincts.', 'N', 'N', 6.9),
	('Quantico', 'Mhorder', 2, 19, 'No', 'No', 'No', 24, 4, 2017, 'With all the collaborators unveiled, the team uses Clay and Maxines engagement party to entice them into one place. The mission: turn one against the others. But everyones lives are put at risk when one member of the team makes a surprising decision.', 'N', 'N', 7),
	('Quantico', 'Globalreach', 2, 20, 'No', 'No', 'No', 1, 5, 2017, 'Risking it all, Alex works with Owen to infiltrate the Collaborators. When they begin to test her loyalty, Alex realizes shes become a pawn in their plan to take down both the President and the task force.', 'N', 'N', 7),
	('Quantico', 'Rainbow', 2, 21, 'No', 'No', 'No', 8, 5, 2017, 'After an impossible choice is made, a flood of new proposals shine a light on the final stages of the Collaborators plan. Fractured but not defeated, the task force, with the help of some old friends, work to put the pieces together before the Collaborators can enact an unthinkable terrorist attack.', 'N', 'N', 7.4),
	('Quantico', 'Resistance', 2, 22, 'No', 'No', 'No', 15, 5, 2017, 'Its Alex and the teams last stand against the Collaborators at the Constitutional Convention, where a new amendment to the Constitution threatens every Americans freedom.', 'N', 'N', 7.7),
	('Samurai X', 'A Man Who Fights For Love', 1, 1, 'Yes', 'Yes', 'NA', 10, 1, 1996, 'Kaoru makes Kenshin stay in the separate room because he saw her naked when she was taking a bath. He was trying to ask if she was OK but thought she was quiet because she was trying to kill herself. Also near the end of the episode when Kaoru invited Kenshin to stay with her, he said that he might see her naked again. She punched him and apologized because she thought he could dodge it seeing he is the Battousai.', 'Y', 'N', 7.6),
	('Samurai X', 'Kid Samurai', 1, 2, 'Yes', 'Yes', 'NA', 17, 1, 1996, 'After nearly being pick-pocketed by the young street urchin Myojin Yahiko, Kenshin takes sympathy on the boy who declares himself to be from a samurai family. After his mother\'s death, Yahiko has been forced into working for the yakuza to pay off his deceased mother\'s debt. Kaoru goes to rescue the boy but finds herself in a perilous situation until Kenshin appears and defeats the yakuza single-handedly. Kaoru then takes Yahiko as her student at Kenshin\'s prompting despite the reluctance of both of them.', 'Y', 'N', 6.9),
	('Samurai X', 'Swordsman Of Sorrow', 1, 3, 'Yes', 'Yes', 'NA', 24, 1, 1996, 'Yahiko is discontent with the teachings of Kamiya-Kasshin-ryu, wanting to defeat his enemies over protecting the innocent. An old acquaintance of Kenshin invites him to join the military.', 'Y', 'N', 6.9),
	('Samurai X', 'Bad! Introducing Sanosuke, Fighter-For-Hire', 1, 4, 'Yes', 'Yes', 'NA', 31, 1, 1996, 'Hiruma Gohei, a man who Kenshin had previously defeated in episode 1 hires Sanosuke Sagara (aka Zanza after his signature weapon, a zanbato) to take Kenshin down. He accepts, but not for the money.', 'Y', 'N', 7.2),
	('Samurai X', 'The Reverse-Blade Sword Versus The Zanbatou', 1, 5, 'Yes', 'Yes', 'NA', 7, 2, 1996, 'Zanza returns to fight Kenshin, and reveals his reason for fighting and his past with the Sekihoutai, where his captain and teammates were used as scapegoats by the government. Kenshin defeats him and breaks the zanbatou, and they become allies.', 'Y', 'N', 7.4),
	('Samurai X', 'The Appearance Of Kurogasa', 1, 6, 'Yes', 'Yes', 'NA', 14, 2, 1996, 'Government officials are being murdered. Jinei, a former hitokiri known for his ruthless attitude, is doing it and the government asks Kenshin for help. When Jinei sees Kenshin, he realizes he has a worthy opponent and kidnaps Kaoru, telling Kenshin to meet him later.', 'Y', 'N', 7.2),
	('Samurai X', 'Deathmatch Under The Moon', 1, 7, 'Yes', 'Yes', 'NA', 21, 2, 1996, 'Jinei has kidnapped Kaoru in order to force Kenshin back into his murderous ways. Kenshin almost kills Jinei, but Kaoru calls out, and he spares him. Jinei then takes his own life.', 'Y', 'N', 8.1),
	('Samurai X', 'A New Battle!', 1, 8, 'Yes', 'Yes', 'NA', 28, 2, 1996, 'One of Sano\'s friends has died from opium when a mysterious woman (Takani Megumi) shows up and needs his and Kenshin\'s help. She is being pursued by the Oniwabanshuu onmitsu, an elite group of ninja that used to protect the Edo castle. They protect her, but Yahiko is poisoned.', 'Y', 'N', 7.5),
	('Samurai X', 'The Strongest Group Of Ninjas', 1, 9, 'Yes', 'Yes', 'NA', 6, 3, 1996, 'Takeda Kanryu forces Megumi to return by threatening the people at the dojo. Sano convinces her to return, but Megumi is captured by one of Kanryu\'s underlings.', 'Y', 'N', 7.7),
	('Samurai X', 'Aoshi', 1, 10, 'Yes', 'Yes', 'NA', 13, 3, 1996, 'The group goes to retrieve Megumi, but the Oniwaban group stands in their way. Kenshin narrowly defeats Hannya and then he and Sano confront commander Shinomori Aoshi. Aoshi takes out Sano with one blow, and then he and Kenshin begin to battle.', 'Y', 'N', 7.6),
	('Samurai X', 'Farewell, The Strongest Men', 1, 11, 'Yes', 'Yes', 'NA', 24, 4, 1996, 'Kenshin narrowly defeats Aoshi. Aoshi asks Kenshin to finish him off, and when Kenshin refuses, Aoshi vows revenge. Kanryu shows up with a gatling gun and kills the four members of the Oniwaban group, who die defending Aoshi. Megumi tries to kill herself for her past misdeeds, but they save her just in time. Aoshi buries his comrades and swears that he will defeat Kenshin for their sake.', 'Y', 'N', 7.9),
	('Samurai X', 'The Birth Of A Boy Swordsman', 1, 12, 'Yes', 'Yes', 'NA', 1, 5, 1996, 'Yahiko meets a cute girl named Tsubame, who works at the Akabeko. She\'s being forced into making a copy of the key to the Akabeko by a group of thugs, and Yahiko decides to help her by himself. He defeats the thugs, although with a little help from the group.', 'Y', 'N', 7.2),
	('Samurai X', 'Strive For The Grand Championship', 1, 13, 'Yes', 'Yes', 'NA', 8, 5, 1996, 'Kaoru takes in Toramaru, a sumo wrestler who has been kicked out of his sumo stable. The leading wrestler fears being overtaken, and uses his status to keep Toramaru down. Kaoru teaches Toramaru to be self confident, and he rejoins the sumo stabl', 'Y', 'N', 5.8),
	('Samurai X', 'Save A Small Life', 1, 14, 'Yes', 'Yes', 'NA', 15, 5, 1996, 'Megumi treats a girl with a life threatening heart condition, but a faith healer enters town and begins to seeminly perform miracles to cure the sick at exhorbitant sums, while spreading rumors that Megumi is a quack. When the young girl is put in a life threatening situation because of her parents\' desperation, the Kenshin-gumi rush to save her before it\'s too late.', 'Y', 'N', 7.4),
	('Samurai X', 'Assassination Group Of Fire', 1, 15, 'Yes', 'Yes', 'NA', 22, 5, 1996, 'The Jinpuu squad is performing vigilante assassinations. They try and force Sasaki, a local schoolteacher, to pick up his sword again, but Sano and Kenshin fight them off. Toma, the Jinpuu leader, vows to kill Kenshin.', 'Y', 'N', 7.1),
	('Samurai X', 'A Promise From The Heart', 1, 16, 'Yes', 'Yes', 'NA', 5, 6, 1996, 'Toma was a former student under Sasaki. Ultimately, the Jinpuu squad is taken down and Toma repents to his former master.', 'Y', 'N', 7.3),
	('Samurai X', 'Fly To Your Dreams', 1, 17, 'Yes', 'Yes', 'NA', 12, 6, 1996, 'The group goes to the circus and Yahiko takes a liking to the \'Human Cannonball\' girl Marimo. A circus boss tries to sabotage the show and make Marimo work for him, but the Kenshin-gumi entertain the crowd until Marimo can find the right mix of gunpowder and fly from the cannon.', 'Y', 'N', 6.7),
	('Samurai X', 'Get Back The Reverse-Blade Sword', 1, 18, 'Yes', 'Yes', 'NA', 19, 6, 1996, 'Hiruma Gohei returns and hires the Onizaki brothers to kill Kenshin. Gohei tricks Yahiko into bringing him the reverse blade sword, and then he ties Yahiko up. Kenshin is outmatched by the Onizaki brothers, but Yahiko escapes and brings the sword, allowing Kenshin to win.', 'Y', 'N', 7.2),
	('Samurai X', 'Raijuta\'s Ambition', 1, 19, 'Yes', 'Yes', 'NA', 26, 6, 1996, 'The Kenshin-gumi go on vacation in Izu. There, a wealthy boy Yutaro falls under the influence of Raijuta, who intends to create a kingdom with his warriors. Kenshin battles Raijuta\'s men for the sake of Yutaro, but they gain the upper hand.', 'Y', 'N', 7.3),
	('Samurai X', 'Revival Of The Shinko Style', 1, 20, 'Yes', 'Yes', 'NA', 10, 7, 1996, 'Kenshin leaves Raijuta\'s warriors to save Yutaro from drowning. Kaoru teaches Yutaro the Kamiya Kasshin style of swordsmanship, although he doesn\'t understand its moral aspects. The military attacks Raijuto and his gang.', 'Y', 'N', 7.3),
	('Samurai X', 'The Dissolution Of A Nightmare', 1, 21, 'Yes', 'Yes', 'NA', 17, 7, 1996, 'Kenshin stops the battle by challenging Raijuta to a one on one battle. He figures out the trick to Raijuta\'s vacuum cut, and defeats him. Yutaro is injured in the battle, and decides to move to Germany for better medical care', 'Y', 'N', 7.6),
	('Samurai X', 'Danger On A Runaway Locomotive', 1, 22, 'Yes', 'Yes', 'NA', 31, 7, 1996, 'The Kenshin-gumi take a train trip to Yokohama for fun. A train robbery ensues, and they defeat the robbers. All the while, Sanosuke complains technology is the work of the devil.', 'Y', 'N', 6.9),
	('Samurai X', 'Sanosuke\'s Betrayal', 1, 23, 'Yes', 'Yes', 'NA', 14, 8, 1996, 'Sanosuke goes to a picture shop to buy a picture for Miss Tae at the Akabeko. While at the picture shop, he stumbles across a portrait of Captain Sagara, drawn by Tsunan Tsukioka, another surviving member of the Sekihoutai. Sano joins with Tsunan and defeats Tashiwachi Shindo, the man who framed Captain Sagara ten years earlier.', 'Y', 'N', 7.4),
	('Samurai X', 'Midnight Battle', 1, 24, 'Yes', 'Yes', 'NA', 21, 8, 1996, 'Sanosuke throws a party at the Kamiya Dojo for everyone. Little does everyone except Kenshin know, Sanosuke is really planning to leave the Kenshin group for good to revive the long lost Sekihoutai with his friend Katsuhiro. Kenshin goes to stop Sanosuke and Katsu from destroying the Internal Affairs Department with bombs. Kenshin stops Sano, and Sano rejoins Kenshin\'s group, and Katsu stops making bombs.', 'Y', 'N', 8),
	('Samurai X', 'The Crimson Pirate', 1, 25, 'Yes', 'Yes', 'NA', 28, 8, 1996, 'In this episode, Kaoru finally gets fed up with Kenshin, Yahiko, and Sanosuke hanging around the Kamiya Dojo, without working or paying any money to help her feed everybody. They feel bad, and go out looking for a job to help pay their way. They sign up for a team of warriors that have been hired to capture the Kairyu pirates, a group of freakish rouges that have been raiding silk ships on the high seas. On the cruise, they come across Kaoru, who has also signed up to raise money for the dojo. They\'re surprised to see each other, and Kenshin is worried about Kaoru\'s safety. The Kairyu pirates are known for their violence, and some even go as far as to call them demons. Their leader, Shuura, is a ruthless masked figher with nunchaku.', 'Y', 'N', 7),
	('Samurai X', 'Lighning Incarnate', 1, 26, 'Yes', 'Yes', 'NA', 4, 9, 1996, 'Shura and the Kairyu land at Kairyu Island with Kenshin. Shura doesn\'t have the heart to kill Kenshin, and so Ginjo, one of the Kairyu who wants to be the new leader instead of Shura, makes up a plan to kill Shura and become leader in her place. Shura gets shot in the leg by Geki, another one of her followers who has now joined Ginjo.', 'Y', 'N', 7.3),
	('Samurai X', 'Burn, Island Of Terror', 1, 27, 'Yes', 'Yes', 'NA', 16, 10, 1996, 'Kenshin helps to nurse Shura back to health, then Shura finds out that Ginjo gave Old Iwa opium. Shura goes off to fight and defeat Ginjo. She is defeated by him, since he played a dirty trick on her. Kenshin then comes in and uses the Ryu Tsui Sen to end the fight. Geki then throws a bomb, destroying Kairyu Island and all its inhabitants, except for Kenshin and Shura.', 'Y', 'N', 7.7),
	('Samurai X', 'Prelude To The Impending Fight', 2, 1, 'Yes', 'Yes', 'NA', 30, 10, 1996, 'The Kenshin-gumi\'s brief period of peace is interrupted by the presence of former Shinsengumi captain Saito Hajime - now using the name of Fujita Goro and working for the Tokyo police - stirs up some of Kenshin\'s bloodiest memories of the Bakumatsu. Saito arrives at the Kamiya dojo disguised as a medicine seller and fights Sanosuke, injuring him severely in the process.', 'Y', 'N', 8.4),
	('Samurai X', 'The Strongest Opponent From The Past', 2, 2, 'Yes', 'Yes', 'NA', 6, 11, 1996, 'Sanosuke is beginning to recover from the wounds inflicted by Saito, but Kenshin\'s mind is greatly disturbed. Akamatsu, another assassin hired by the same man who is paying Saito fights Kenshin by drawing him out but loses to Kenshin while Saito arrives at the dojo using his status as a policeman to gain entrance. Kenshin and Saito begin to fight, despite Kaoru\'s attempt to stop them as she begs Kenshin not to revert to his Battousai persona.', 'Y', 'N', 8.7),
	('Samurai X', 'The Devil Of Vengence', 2, 3, 'Yes', 'Yes', 'NA', 13, 11, 1996, 'The battle between Kenshin and Saito continues after Kenshin is stabbed by Saito\'s Gatotsu Sanshiki. Kaoru is frightened to see Kenshin\'s Battousai persona begin to emerge and begins to lose hope that she will ever see the gentle Rurouni again. However, one of Saito\'s superiors appears and stops the fight just as it is reaching a climax and Kenshin returns to normal after punching himself in the face. Okubo explains to Kenshin that Shishio Makoto, the man who took over Kenshin\'s position as the Shadow Hitokiri for the Ishinshishi survived being burned alive and has begun gathering an army to overthrow the government, and hopes that Kenshin can defeat him, with the threat of Megumi being turned in for opium manufacture unless he complies. Megumi states she would rather die that be used as a pawn against Kenshin, and he is given a deadline upon which to decide.', 'Y', 'N', 9),
	('Samurai X', 'A Wish Unrequited', 2, 4, 'Yes', 'Yes', 'NA', 27, 11, 1996, 'As the deadline for Kenshin\'s decision on whether to go to Kyoto nears Kaoru becomes anxious at the possibility of his leaving. After Okubo\'s assassination by Seta Sojiro, Kenshin decides to go to Kyoto and bids an emotional goodbye to Kaoru, implying that it is likely they will never meet again.', 'Y', 'N', 8.9),
	('Samurai X', 'Change Tears To Courage', 2, 5, 'Yes', 'Yes', 'NA', 4, 12, 1996, 'Kaoru is deeply depressed and distressed since Kenshin left Tokyo. With the help of Tae, Yahiko, Tsubame, and especially Megumi, Kaoru regains her courage and decides to leave Tokyo to go to Kyoto and see Kenshin. Saito also gets into a fight with Sanosuke, telling him not to go to Kyoto. Sanosuke leaves on his own despite Saito\'s warning that he will be a liability to Kenshin.', 'Y', 'N', 8.3),
	('Samurai X', 'For The Title Of Strongest', 2, 6, 'Yes', 'Yes', 'NA', 11, 12, 1996, 'Aoshi Shinomori has now chosen the path of chaos. He will do anything to defeat Kenshin, as he feels it will prove to the world that the Oniwaban Group were the strongest fighters of the Revolution. Aoshi defeats four monks working for Shishio, who were merely meant to test Aoshi\'s strength, but refuses to join Shishio after Sojiro tries to convince him.', 'Y', 'N', 8.2),
	('Samurai X', 'The Girl Bandit', 2, 7, 'Yes', 'Yes', 'NA', 8, 1, 1997, 'Makimachi Misao, the girl bandit, whom Kenshin meets in the forest, is a member of the Oniwaban Group. She wants very badly to see Aoshi and the other four Oniwaban Group members, though she is unaware of the fate of the four Oniwaban ninjas, and she doesn\'t yet know the whereabouts of Aoshi. Misao refuses to stop chasing Kenshin, as she believes that he can lead her to them.', 'Y', 'N', 7.5),
	('Samurai X', 'Conquered Village', 2, 8, 'Yes', 'Yes', 'NA', 15, 1, 1997, 'Along the way to Kyoto, Kenshin and Misao come across a nearly dead man with his little brother in his arms, Eiji Mishima. The man dies, and Eiji wants to avenge his brother\'s death by killing Senkaku, the man who slayed his elder brother. Kenshin, Eiji, and Misao travel to Shingetsu Village, Eiji\'s hometown, and fight some of Shishio\'s soldiers off. Saito and Kenshin leave Misao and Eiji behind, as they go to Shishio\'s mansion nearby.', 'Y', 'N', 8.2),
	('Samurai X', 'Across The Boundary Between Edo And Meiji', 2, 9, 'Yes', 'Yes', 'NA', 22, 1, 1997, 'Kenshin and Senkaku fight, and Kenshin wins with ease. Misao and Eiji make their way up to the same mansion in an attempt to defeat Senkaku for themselves.', 'Y', 'N', 8.8),
	('Samurai X', 'Shock! Reverse Blade Sword Broken', 2, 10, 'Yes', 'Yes', 'NA', 29, 1, 1997, 'Shishio is then challenged by Kenshin, but Shishio refuses to accept, saying that Kenshin is weak as a wanderer, and that even if there were 100 of him, Kenshin could not defeat Shishio as Kenshin is now. Shishio tells Sojiro, his right hand man, to fight Kenshin instead. Shishio and Yumi leave the mansion. Sojiro and Kenshin both use the battojutsu drawing technique. Kenshin\'s sword is broken in two, and Shishio\'s Nagasoni Kotetsu, which he gave to Sojiro to fight Kenshin with, is also severely damaged. Sojiro leaves the mansion, telling Kenshin to get a new sword before they meet again.', 'Y', 'N', 8.4),
	('Samurai X', 'Sanosuke\'s Secret Training', 2, 11, 'Yes', 'Yes', 'NA', 5, 2, 1997, 'Sanosuke gets lost in a forest. He finds a monk there that goes by the name of Anji. Anji gives Sanosuke some food. Sanosuke ends up convincing Anji to teach him how to use the Futae no Kiwami, a very destructive punch (so destructive that it can completely pulverize huge boulders into dust with a single punch). Sanosuke has one week to learn it or Anji will kill him. Sanosuke finally learns it, and then leaves for Kyoto.', 'Y', 'N', 8.3),
	('Samurai X', 'The Creator Of The Reverse Blade', 2, 12, 'Yes', 'Yes', 'NA', 12, 2, 1997, 'Kenshin and Misao make it to Kyoto. There, they meet Okina and four other members of the Oniwaban Group. Okina knows Kenshin is the legendary Battousai the Manslayer the moment he lays eyes on him. Kenshin goes to see Sekku Arai, Shakku Arai\'s son (Shakku was the one who made Kenshin\'s Reverse Blade Sword that broke) to get a new Reverse Blade Sword. Sekku refuses, saying that this is a time of peace, and that the samurai have all thrown their swords away. Later, Chou the Swordhunter of the Jupongottana abducts Iori, Sekku\'s baby son. Kenshin demands that Chou release Iori.', 'Y', 'N', 8.8),
	('Samurai X', 'A Killer Without Mercy', 2, 13, 'Yes', 'Yes', 'NA', 19, 2, 1997, 'Kenshin finds Sawagejo Cho has kidnapped the child of Shakku\'s son in order to obtain Shakku\'s final work for himself. Kenshin is forced to choose between keeping his vow not to kill and saving the baby, deciding to save the child and draw the sword he has been given. However, just when it seems he has broken his vow and killed Cho, it is revealed that the sword he is holding is Shakku\'s final work, Shinuchi, a sakabato, and Cho is merely stunned. Kenshin then leaves to find his master, Hiko Seijuro, in order to learn the final technique of Hiten Misturugi-Ryu.', 'Y', 'N', 8),
	('Samurai X', 'The Ultimate Technique Of The Hiten Mitsurugi Style', 2, 14, 'Yes', 'Yes', 'NA', 26, 2, 1997, 'Kenshin finds his master Hiko Seijuro living as a potter near Kyoto, but Hiko is initially unwilling to take Kenshin back due to his walking out to join the Revolution. Yahiko and Kaoru meet Misao in Kyoto after learning that she saw Kenshin leaving, and later leads the grateful pair to him after they meet Okina at the Aoi-Ya. Kenshin seems initially upset at the sight of Kaoru, but later replies he is only \'half\' angry. They leave Kenshin to train, and on the way Misao\'s affiliation with the Oniwabanshu is revealed as well as the fact that she does not know of the fate of Aoshi\'s group in Edo.', 'Y', 'N', 8.1),
	('Samurai X', 'The Formation Of An Alliance', 2, 15, 'Yes', 'Yes', 'NA', 5, 3, 1997, 'Misao is in denial after hearing of the deaths of Aoshi\'s men, and feels despair as she recalls her country-wide search for Aoshi, which ended without success. Meanwhile, Aoshi sends a letter to Okina and they meet in a Kyoto market, where Okina tells Aoshi that his desire to kill Kenshin has turned him into a demon, and that as the leader of the Oniwabanshu Okina cannot allow this to continue. Seta Sojiro and several other Juppongatana meet Aoshi and convince him to join them, as they share the goal of destroying Kenshin. After Okina mysteriously leaves with his shinobi uniform Misao realizes that the two will have a confrontation at the temple and runs to stop it, but proves to be too late as Okina falls to Aoshi\'s Kaiten Kenbu Rokuren, and is told by Aoshi that the next time they meet he will kill her.', 'Y', 'N', 8.3),
	('Samurai X', 'Between Life And Death', 2, 16, 'Yes', 'Yes', 'NA', 12, 3, 1997, 'The episode starts off with Seijuro Hiko remembering the past about when he first met Kenshin and while they were continuing the training Kenshin finally proves himself worthy of learning the final technique, so Hiko begins to start by teaching him the Kuzu-ryusen, a technique where it will hit 9 targets of martial arts at one time. Then Hiko instructs Kenshin to try the attack. Kenshin uses the attack flawlessly but Hiko performed one of his own and the end result is that Kenshin lost this skirmish due to his lacking in weight and size. Then after learning this Hiko proclaims \'you must defeat this technique with the ultimate attack\'. After much worry about his friends Kenshin finally looks within himself for what he was missing in life and learns the ultimate technique, the Amakakeru Ryu No Hirameki, which is the will to live, said to be \'stronger than anything\'. Though he has to pay a very high price.', 'Y', 'N', 9.1),
	('Samurai X', 'A Decisive Battle Like Violent Waters', 2, 17, 'Yes', 'Yes', 'NA', 19, 3, 1997, 'The Juppongottana have gathered in the temple of Shishio in Kyoto, and are ready to commence the Kyoto Grand Fire and be on their path to victory.', 'Y', 'N', 8.4),
	('Samurai X', 'As If To Fly', 2, 18, 'Yes', 'Yes', 'NA', 16, 4, 1997, 'Sanosuke, Saito, and Kenshin go to Osaka to find Shishio and his men onboard a ship. They find Shishio, and Shishio launches the Purgatory, a steel-plated battleship he paid a fortune to get. Shishio plans to use the Purgatory to launch an assault on Tokyo.', 'Y', 'N', 8.3),
	('Samurai X', 'Purgatory Bursts Into Flames', 2, 19, 'Yes', 'Yes', 'NA', 23, 4, 1997, 'Sanosuke uses the Futae no Kiwami Anji taught him to stop Gatling gun bullets from hitting him. He then throws the bombs Katsu gave him before he left Tokyo right onto the Purgatory, damaging the engine and leaving a hole in the ship. The Purgatory eventually sinks, but not until Saito, Kenshin, and Sanosuke get off safely. Shishio issues a challenge; Kenshin can only meet him at his base and get to him by completing one-on-one fights. Kyoto is spared from the Kyoto Grand Fire as well, thanks to intervention by the Oniwaban, now headed by Misao.', 'Y', 'N', 8.3),
	('Samurai X', 'Crash! The Lethal Punch, Futae No Kiwami', 2, 20, 'Yes', 'Yes', 'NA', 30, 4, 1997, 'Sanosuke, Saito, and Kenshin journey to Mount Hiei at the Shrine of the Six Arches to settle the score with Shishio. The first challenger of the Juppongottana in the shrine is Anji the Destroyer, the man who taught Sanosuke the basics of the Futae no Kiwami. Anji and Sanosuke duel, and Sanosuke uses a Futae no Kiwami attack at full power, called the Kiwami Hazuchi, and knocks Anji down. Sanosuke thinks he is dead, until he gets back up more angry than ever.', 'Y', 'N', 8.3),
	('Samurai X', 'Reborn To Salvation', 2, 21, 'Yes', 'Yes', 'NA', 14, 5, 1997, 'Anji and Sanosuke continue their duel, and Anji is reborn to salvation after talking about his past and being convinced by Sanosuke and the memories from the people of his past that he was doing the wrong thing all these years by being a destroyer. Kenshin and Saito continue on ahead to fight Usui, the second challenger of the Jupongottana.', 'Y', 'N', 8.7),
	('Samurai X', 'The Wolf Destroys The Eye Of The Heat', 2, 22, 'Yes', 'Yes', 'NA', 28, 5, 1997, 'Uonuma Usui confronts Saito while the others continue on through Shishio\'s mansion. Usui\'s claim to \'True Vision\' is put to the test by Saito, who sees it for what it really is - simply super enhanced hearing adopted by Usui to make up for his lack of sight. Saito realizes that Usui is in fact weak since his desire for revenge against Shishio has driven him to become a mere pawn in Shishio\'s game. An enraged Usui wounds Saito using the timbe, a tortoise-shell shield and blocks his vision, however, Usui is no match for Saito\'s Zeroshiki, a move Saito had been saving for a fight against Kenshin.', 'Y', 'N', 8.6),
	('Samurai X', 'The Promised Time Has Come', 2, 23, 'Yes', 'Yes', 'NA', 4, 6, 1997, 'Kenshin senses something coming from Houji\'s room, and then senses that it is Aoshi Shinomori. He enters the room, and is determined to keep his promise to Aoshi Shinomori, and to Misao Makimachi by fighting, and bringing back Aoshi to Aoiya. Upon entering the room, Aoshi greets him, and he says that he has thrown everything away, including his four comrades, just for the moment of the duel with him and Kenshin. Aoshi is determined to win the fight and kill the Battousai, to claim the title of the strongest.', 'Y', 'N', 8.3),
	('Samurai X', 'Wake Up Now!', 2, 24, 'Yes', 'Yes', 'NA', 11, 6, 1997, 'As the duel between Aoshi and Kenshin continues, Kenshin is being attacked by Aoshi while he tries to say words to Aoshi to try and wake him up; to make him become the man he used to be. Kenshin is determined to return Aoshi to what he used to be: a man of caring, and happiness, so that he can bring back the true Aoshi to Misao, and keep both promises he made to both of them. Aoshi realizes that what he has been doing was wrong all along, and they both used their final attacks on each other. Ultimately Kenshin emerged victorious and Kenshin, Sanosuke Sagara and Yumi Komagota move on to the next battle.', 'Y', 'N', 8.3),
	('Samurai X', 'To Make A Miracle', 2, 25, 'Yes', 'Yes', 'NA', 18, 6, 1997, 'The battle at the Aoiya continues, as Iwanbo, Henya, and Kamatari fight against the Oniwaban Group and Yahiko and Kaoru. Yahiko manages to defeat Henya, after being almost killed by his Hikku Happa attack. After that, Kamatari, Kaoru, and Misao fight. Misao gets crushed ribs in the fight against Kamatari, and is unable to continue until she wakes up from a dream of Hannya, and she and Kaoru defeat Kamatari through a combined effort. It seems like they have won, until two other Juppongatana members, Fuji and Saitsuchi, appear. Things are not looking good for the ones who remained at the Aoiya.', 'Y', 'N', 7.9),
	('Samurai X', 'The Giant Versus Superman', 2, 26, 'Yes', 'Yes', 'NA', 25, 6, 1997, 'Just when all hope seems lost, Seijuro Hiko shows up and fights Fuji. He talks to Fuji and makes he realize that he was being used and ask for a fair fight. He defeats Fuji with the Kuzu Ryu Sen. The Aoiya is safe from harm, but Kenshin still has to fight Sojiro in order to fight Shishio himself.', 'Y', 'N', 8.1),
	('Samurai X', 'Hiten Versus Shukuchi', 2, 27, 'Yes', 'Yes', 'NA', 2, 7, 1997, 'Sojiro and Kenshin have their second duel, since the one in Shingetsu Village was never finished. Sojiro shows Kenshin the Shukuchi attack, an attack that brings him to his opponent in an instant, because he uses powerful legwork. Kenshin manages to get himself pretty wounded in the fight, and Sojiro hasn\'t even gotten hit once. He even dodges the Kuzu Ryu Sen, an attack Hiko said was unblockable.', 'Y', 'N', 8.2),
	('Samurai X', 'The Tragedy Of A Stormy Night', 2, 28, 'Yes', 'Yes', 'NA', 9, 7, 1997, 'While Sojiro is occupied by constantly re-tieing his shoe, he thinks of the moments of his past, and all of the bad stuff that happened in it. Sojiro\'s past is shown throughout the entire episode. Sojiro\'s family never loved him, and only wanted him so they could use him. They made him carry hundreds of buckets of rice, and when Sojiro returns a bucket of rice to his house, one of Sojiro\'s family members breaks the bucket on purpose. Then, another person who likes to cause Sojiro trouble and use him, named Yanosuke, calls out his father who is inside, blaming Sojiro for breaking the bucket. He then meets Makoto Shishio, whom spared his life. Shishio gave him a Wakizashi sword. When his family has cornered him, he murders them with this sword. Then, Sojiro follows Shishio, as Shishio tells Sojiro that he will become strong.', 'Y', 'N', 8.5),
	('Samurai X', 'A Duel With An Extreme Moment', 2, 29, 'Yes', 'Yes', 'NA', 16, 7, 1997, 'Continuing from the last episode, Sojiro thinks about his past a little bit more, and thinks of Shishio\'s \'survival of the fittest\', and Kenshin\'s way of not killing people. Sojiro gets very confused, not knowing which person to believe, and he suddenly breaks down during the fight. He goes crazy, and tells Kenshin that he is only getting in his way, and that the very fact that he\'s in the room makes him ticked off. Sojiro then fights Kenshin at his full strength, using an attack he named the Shu Ten Satsu its a combination of the shukchi speed and the Battojutsu of the tenken. Then they both do a Battojutsu stance. Kenshin emerges victorious by using his ultimate attack, the Amakakeru Ryu no Hirameki on him. Sojiro then tells Yumi to return his Wakizashi to Shishio, and also gives Yumi the details of Kenshin\'s ultimate attack, as a parting gift Sojiro leaves Shishio\'s side forever, and Kenshin and the others make their way to the final battle with Makoto Shishio.', 'Y', 'N', 8.1),
	('Samurai X', 'Two Men At The End Of An Era', 2, 30, 'Yes', 'Yes', 'NA', 6, 8, 1997, 'As Kenshin, Sanosuke, and Yumi make their way to the top of the Inferno Arena, Kenshin thinks about his past, and what awaits him next, the entire way up to where Shishio himself is waiting. However, Kenshin is ready and prepared to the final battle with the manslayer known as Shishio. Upon reaching the door at the top, Yumi pulls the switch to open the door. Shishio is standing in the middle of the arena, and Houji is also there. After a few opening words with Kenshin and Shishio, Shishio promises Yumi that the battle will end quickly. He gives Yumi a kiss, walks off, and the fight between the two manslayers begins! Shishio shows off his first Secret Sword attack, the Homura Dama. He then bites a chunk off of Kenshin\'s shoulder.', 'Y', 'N', 7.9),
	('Samurai X', 'The Age Chooses Shishio', 2, 31, 'Yes', 'Yes', 'NA', 13, 8, 1997, 'The fight between Kenshin and Shishio continues. Kenshin and Shishio then start talking about Shishio\'s greatest shura that he trained himself, Sojiro. Shishio doesn\'t believe that Kenshin understands the laws of nature, and then he tries to show it to Kenshin, by using the Homura Dama. However, after creating a circle of flames around Kenshin, he picks him up, and ignites the gunpowder tucked inside his gauntlet. This the second Secret Sword attack, known as the Guren Kaina. This knocks out Kenshin, nearly causing his death! However, not all hope is lost. Saito busts through the door, using his Gatotsu attack (the first style). Due to a metal protection on Shishio\'s forehead, this doesn\'t affect him. After trying all of the Gatotsu styles, Saito gets knocked out by Shishio. Sanosuke attempts to attack him, but fails. Suddenly, when all hope seems lost, Aoshi appears to engage in combat with Shishio.', 'Y', 'N', 8.6),
	('Samurai X', 'Not Out Of Luck', 2, 32, 'Yes', 'Yes', 'NA', 20, 8, 1997, 'After a short conversation between Aoshi and Shishio, they both engage in combat with each other. However, even with Aoshi\'s Kaiten Kenbu Rokuren, he cannot defeat Shishio. Suddenly, after buying enough time for Kenshin, Kenshin himself appears to be standing! Due to his swordsman spirit, he was able to survive the wounds caused by the Guren Kaina. Now round two commences. Just when Shishio is about to finish Kenshin off with another Guren Kaina, he remembers the promise he made to Kaoru to go back to Tokyo together. He then uses a five-hit combo on Shishio, and does the Ku Zu Ryu Sen, of the Hiten Mitsurugi Style. Shishio gets back up because of his swordsman spirit, and the final round is about to commence.', 'Y', 'N', 8.1),
	('Samurai X', 'Chosen For Victory', 2, 33, 'Yes', 'Yes', 'NA', 3, 9, 1997, 'Getting back on his feet after the Ku Zu Ryu Sen, Shishio gets ready to use the final and ultimate Secret Sword attack, the Kaguzuchi. Kenshin also prepares to use his ultimate move, the Amakakeru Ryu no Hirameki. The blades end up hitting each other and the attack does not connect properly. However, Kenshin\'s attack created a vacuum utilizing the Amakakeru Ryu no Hirameki and the Kaguzuchi\'s sheer power, and temporariliy immobilized Shishio. Not missing this chance, Kenshin strikes Shishio with an immensely strong consecutive hit. Shishio miraculously stands back up, but since he has fought far longer than fifteen minutes, his blood starts evaporating and he begins screaming in pain. In utter fear of Shishio\'s death, Yumi rushes over by Shishio, and begs Kenshin not to finish him off. However, Shishio stabs Kenshin through Yumi! He is determined to continue fighting, and Yumi dies happily, knowing she did something useful for once. As the battle continues, the battle is once again at a standstill. Then suddenly, the scorching heat in Shishio\'s body causes him to end up being burned alive once again, this time fatally. Houji, refusing to accept Shishio\'s defeat, maniacally attempts to destroy the Inferno Arena to take out Sanosuke, Kenshin, Saito, and Aoshi.', 'Y', 'N', 8.6),
	('Samurai X', 'The Juppongatana Who Remain', 2, 34, 'Yes', 'Yes', 'NA', 10, 9, 1997, 'Sano and Aoshi drag an unconscious Kenshin as they run from the burning Building. They eventually escape, but Saito was left behind because his legs were too injured to jump the bridge/walkway that had collapsed. So Saito is now presumed dead. Chou the Swordhunter also appears to tell the group what was happened to the rest of the Juponggottana. The episode ends with Makoto Shishio, Yumi, and Houji gathering in hell, scheming how to take over.', 'Y', 'N', 8),
	('Samurai X', 'Kyoto, The Engraved Memory', 2, 35, 'Yes', 'Yes', 'NA', 17, 9, 1997, 'Yahiko visits Mount Hiei, and Sanosuke shows him where that battle with Shishio took place. Meanwhile, Kenshin visits an unknown woman\'s grave, and places flowers by it. Also at this time, Megumi explains to Kaoru the severity of Kenshin\'s wounds, and that it is important to keep him from doing anything that dangerous again. Finally, the gang gets on the train to Tokyo, with Misao waving to them and telling them to visit again. After the train departs Saito is seen saying that he and Kenshin will meet again one day and settle the score that they have. When the gang reaches the road to the dojo, Kaoru extends her hand and welcomes Kenshin home. Kenshin smiles and says, \'It\'s good to be home.\'', 'Y', 'N', 8.4),
	('Samurai X', 'The Legend Of The Fireflies', 3, 1, 'Yes', 'Yes', 'NA', 14, 10, 1997, 'Kenshin goes off fishing to bring some food on the table. At the river he meets an old man who tells him the legend of the fireflies. At the end it is revealed the old man was telling Kenshin the tragic story of his dead lover, who died waiting for him to return from his long quest to master the sword. He gives Kenshin the message that once in his life, every man meets a woman he will never forget. After hearing his story, Kenshin brings back an iris flower, which he does not give to Kaoru.', 'Y', 'N', 7.8),
	('Samurai X', 'The Birthplace Of Yahiko', 3, 2, 'Yes', 'Yes', 'NA', 28, 10, 1997, 'A foreign prince is attacked by bandits. As Kenshin and Kaoru are returning from a play, they see this and Kenshin intervenes. During the attack the prince was injured, so Kenshin and Kaoru take them back to the dojo. As it turns out, Prince Shin looks exactly like Yahiko, and so Yahiko is put in his place to attend a banquet. At the banquet the bandits attack yet again, but our favorite samurai is there to protect Yahiko, along with Sanosuke.', 'Y', 'N', 6.4),
	('Samurai X', 'Find The Lost Treasure', 3, 3, 'Yes', 'Yes', 'NA', 4, 11, 1997, 'When he finds himself under attack by the Kenwadan, a gang of masked men, a politician, Mr Takamori, throws the key to his safe into an alleyway. Unexpectedly, the key is promptly picked up by a dog, who then escapes with it into a river, despite the gang\'s frantic pursuit. While praying at the shrine for better luck at dice, Sanosuke comes across the dog, now half-dead, and carries it back to the Kamiya dojo to be looked at by Megumi. Cue comic adventures as the dog, which Sanosuke names Notaro, promptly tears the Kenshin Group\'s lives apart, eating their food, stealing and burying their possessions, and generally making a nuisance of himself. But it doesn\'t take the Kenwadan Gang long to track Notaro down. Will Kenshin and the others be able to fend them off and find the key before the gang do?', 'Y', 'N', 6.2),
	('Samurai X', 'Kaoru, Ecstatic', 3, 4, 'Yes', 'Yes', 'NA', 11, 11, 1997, 'It is Tanabata, July 7th. Tsubame-chan, Kaoru, and Tae-san are window shopping. Tae tells Kaoru what an engagement ring symbolizes. Kaoru starts daydreaming about Kenshin asking her to marry him, the wedding, the wedding night and we break to Kaoru passed out flat on her back in the middle of the street with Tae leaning over her. Tae decides that Kaoru is frustrated and needs her help to find happiness with Kenshin. Kenshin goes fishing and comes back with a catfish. Kaoru apparently hates catfish. Kenshin takes a bite of fish and bites into a ring. Tae talks him into giving the ring to Kaoru. Turns out the ring belonged to a guy who was going to propose to his girlfriend, wonder how much trouble the Kenshin-group goes through to pry the ring off of her finger. From jujutsu, to checking through her underwear, all the way to intoxicating her with beer. Can they get it off, in time to to stop the hopeless romantic from committing suicide?', 'Y', 'N', 6.5),
	('Samurai X', 'Gleaming Blade Of Legends!', 3, 5, 'Yes', 'Yes', 'NA', 18, 11, 1997, 'The Kenshin-gumi receives a letter from Misao. She reports on a murder mystery in Kyoto and a dead body with strange carvings on the flesh. Aoshi is approached by a man seeking protection from a written death threat. Aoshi refuses, but Misao sees the letter and takes it to Okina. Okina says the writing is either Portuguese or Dutch, and the symbol on the bottom of the letter was the same symbol carved into the body of the murdered man.', 'Y', 'N', 6.7),
	('Samurai X', 'The Medallion Of Destiny', 3, 6, 'Yes', 'Yes', 'NA', 25, 11, 1997, 'Amakusa Shougo appears at the place Cho is protecting. He defeats Cho and then kills the man he came to kill. Cho tells Kenshin that Amakusa is better than Kenshin. Okina finds out that the three men Amakusa has killed were responsible for persecuting Christians during the Edo dynasty.', 'Y', 'N', 6.6),
	('Samurai X', 'Battlefield Of Shimabara', 3, 7, 'Yes', 'Yes', 'NA', 2, 12, 1997, 'In Shimabara, Yahiko almost gets run down by a carriage carrying the Ambassador of Holland, Elsten-dono. Kenshin and Elsten recognize each other, since Kenshin saved Elsten\'s life 10 years ago at the end of the Edo dynasty. The Kenshin-gumi go to the ambassador\'s residence for tea and crumpets. Magdaria and Shougo are traveling by carriage, then boat to Shimabara.', 'Y', 'N', 6.6),
	('Samurai X', 'Shock Of The Rai Ryu Sen!', 3, 8, 'Yes', 'Yes', 'NA', 9, 12, 1997, 'The round man has Kenshin down and surrounded by the dogs, but then he loses the whistle with which he controls them. Kenshin ends up saving himself and the round man from the dogs. The round man is confused, since Kaioh-sama told him that Kenshin is a demon and has to be killed, but Kenshin saved the round man\'s life. The round man chains Kenshin to a tree and goes for Magdaria to see what he should do with Kenshin.', 'Y', 'N', 7),
	('Samurai X', 'The Conspiracy Of Kaiou', 3, 9, 'Yes', 'Yes', 'NA', 16, 12, 1997, 'Sano is unconscious and lying on the floor of a cave. When he wakes up, he finds himself looking into the face of Magdaria. She notices he is hurt and takes him back to her home in the hill. While she patches him up, they have an argument and she locks him in the room. Meanwhile, Kaioh, Santo, and Amakusa Shougo are plotting the demise of the Meiji government through the instigation of a civil war, but they are disagreeing over price and methodology. Carrying a gun, Magdaria returns to the room where she locked Sano, but he has disappeared.', 'Y', 'N', 6.5),
	('Samurai X', 'Days Of Remorse', 3, 10, 'Yes', 'Yes', 'NA', 6, 1, 1998, 'Misao tells Kenshin what she knows, Shougo and Magdaria(Sayo) are hiding a secret, in the past Shougo was able to help cure people\'s illness because he had study under the field of medicine, but he can\'t cure his sister and she\'s dying. Soon after Kenshin, Kaoru, Yahiko and Kenshin leave and gets caught by someone. Later on, Magdaria is informed that Kaiou has her medallion so she went into his room and went looking for it. She found some more interesting things and found out that Kaiou is going to betray her and her brother. Sanosuke and Shouzo show up and were trying to stop Kaiou but got locked into the cage with Magdaria, to make matters worse an explosion occurred and rocks were falling down on them.', 'Y', 'N', 6.7),
	('Samurai X', 'The Sneering Demon', 3, 11, 'Yes', 'Yes', 'NA', 13, 1, 1998, 'Kenshin is caught by someone and he takes him out quickily. Meanwhile the rocks had fallen and Shouzo was trapped, Sanosuke and Magdaria managed to get out fine. Sanosuke and Magdaria worked together and got him out. Shouzo got away and went to report this to Shougo. Meanwhile someone showed up to take Sanosuke out, it was no problem and he was defeated, but he would not give up, he attacked once more time but Misao and Yahiko helped. Together they got out of the cave but Magdaria was very sick and Sanosuke ran as fast as he could to bring her to Elsten. Later on, Shouzo had overheard Kaiou\'s plans and tried to fight him but was defeated, as a last resort he threw some pipe bombs that Sanosuke gave him and killed Kaiou.', 'Y', 'N', 6.8),
	('Samurai X', 'Sanosuke\'s Tears', 3, 12, 'Yes', 'Yes', 'NA', 20, 1, 1998, 'The army started to prepare themselves to fight Shougo and kill everyone else. Sanosuke continued to try and bring Magdaria to Elsten. After achieving many obstacles Sanosuke finds some luck and sees Elsten. Elsten was interfering too much so Santo tried to kill him but Magdaria jumped in and was shot. Sanosuke beat up Santo and returned Magdaria\'s medallion back to her, shortly after she died. Elsten left and tried to hurry and get to the holy hill to stop the fight. Meanwhile Kenshin finally arrived and tried to stop the fight, he had found Shougo and would fight him if he would force the children to sacrifice themselves.', 'Y', 'N', 7.9),
	('Samurai X', 'The Last Crusade', 3, 13, 'Yes', 'Yes', 'NA', 27, 1, 1998, 'Misao was caught by two men and was brought to the leader of the army, she kept on telling them that Kenshin is negotiating with Shougo. Finally Elsten arrived and tried to stop the attack, he was only able to stop it for an hour, after the hour they would attack. Misao went off to tell Kenshin he has an hour and if he was successful she would throw a signal out to let him know. Kenshin had already started to fight Shougo, finally both used the succession technique and Shougo was defeated. Kenshin had gained his sight again and Misao just arrived.', 'Y', 'N', 7.1),
	('Samurai X', 'Bon Voyage', 3, 14, 'Yes', 'Yes', 'NA', 3, 2, 1998, 'The war was over and Shougo surrendered. Kenshin visited Elsten to find out what will happen to the believers and so on. Elsten is waiting for the government\'s decision and it should arrive shortly. An official arrives and tells them that the believers can no longer stay in Japan, Elsten is thankful for the decision and decides that the believers can come to his country, Holland. Meanwhile Sanosuke gives Kaoru a letter and she makes a visit to Shougo. Kaoru gives the letter to Shougo and leaves. Shougo makes a last visit to his sister\'s grave and left to go to Holland.', 'Y', 'N', 6.8),
	('Samurai X', 'Himura Dojo In Shimonoseki', 3, 15, 'Yes', 'Yes', 'NA', 10, 2, 1998, 'Kenshin and the rest are in the restaurant eating, suddenly a group called Tengu creates a disturbance, Yahiko and Misao take them outside and fight them. Then a man claiming to be the legendary Battousai arrives and scares them away. Kenshin and the rest are looking for a place to stay but they were all full, they make their way up to the fake Battousai\'s place and sees he\'s running a dojo. Kenshin and the others help out and have a place to stay. The Tengu group is getting restless and wants to kill the Battousai, a man named Anzai arrives and says he will kill the Battousai. He arrives at the dojo and wants to fight the Battousai, Kenshin came right on time and defeated him. Kenshin allowed him to keep the name and he and the rest set sail to go back home.', 'Y', 'N', 6.8),
	('Samurai X', 'Crush!', 3, 16, 'Yes', 'Yes', 'NA', 17, 2, 1998, 'Kenshin and the rest are walking through the forest, they end up going to a restaurant to eat, and when the time came to pay for it, Kenshin had lost Kaoru\'s money. Kenshin and the rest offered to work off the money. Kaoru and Misao were making trips to send people their meal and accidentally went into the wrong room. Later that night Misao and Kaoru were in the hot springs and they spotted someone. They realized it was an artist seeking inspiration and Kaoru was it. The artist had fallen in love with Kaoru but Kaoru was in love with Kenshin, Misao had an idea and told Sanosuke, Sanosuke told the artist if he can hit Kenshin he will hook him up with Kaoru. No matter how hard the artist tried he couldn\'t hit Kenshin. Finally he got his inspiration and drew a portrait of Kaoru and gave it her. Kenshin and the rest left and saw Kaoru\'s picture, it was an abstract drawing and they laughed while running away.', 'Y', 'N', 6.6),
	('Samurai X', 'Katsu Kaishi And Kenshin', 3, 17, 'Yes', 'Yes', 'NA', 24, 2, 1998, 'A man is talking about people being able to go to the moon, but the others laugh at him, he left with his teacher and forgot his books. Yahiko went to return the books but the man (Daigoro) and his teacher was going to be attacked. Yahiko and everyone helped out and were able to protect them, then Tetsuma appeared and scared them away. Daigoro\'s teacher than kicked him out of his dojo since he wasn\'t very good with a sword. Kaoru decided to accept him as a student and tried to teach him to be strong. A girl named Itsuko came and tried to bring him back but Daigoro refused and Itsuko stayed behind. Kenshin left and went to tell Daigoro\'s teacher (Katsu) that his daughter was staying at the dojo, as Kenshin leaves the men earlier is trying to attack Kenshin.', 'Y', 'N', 6.8),
	('Samurai X', 'The Unending Revolution', 3, 18, 'Yes', 'Yes', 'NA', 3, 3, 1998, 'A bunch of men are ready to attack Kenshin but Kenshin has no idea who these people are, they tell Kenshin that they are the Beni Aoi, Kenshin still doesn\'t know who they are, the leader figures out Kenshin wasn\'t hired as a bodyguard and left. Daigoro continues to train and has a match with Yahiko. Daigoro attacks but pulls his back and is unable to move. Itsuko is cooking and Kaoru shows up, she teachers her to cook but forgot to buy something so she left. Outside the Beni Aoi was waiting for her and kidnapped her. Kaoru screamed and didn\'t know what to do, the kitchen was on fire, Kenshin sensed something was wrong and asked where Itsuko was, he went out side and found her hair pin on the ground.', 'Y', 'N', 6.7),
	('Samurai X', 'Conspiracy Of The Beni-aoi', 3, 19, 'Yes', 'Yes', 'NA', 10, 3, 1998, 'Itsuko was kidnapped and Katsu had received a letter about it, Kenshin paid a visit to him and found out that Katsu was hiding someone\'s money and the Beni Aoi wanted it. Katsu was suppose to arrive at 2:00am at a temple, and if he cooperates his daughter would not be harmed. Kenshin was told not to come but he still went as well as everyone else including Daigoro. They arrived at the temple first and Daigoro say Itsuko, she tried to run for it but tripped, Daigoro charged forward and was stabbed.', 'Y', 'N', 6.8),
	('Samurai X', 'Kaishu Katsu\'s Determination', 3, 20, 'Yes', 'Yes', 'NA', 14, 4, 1998, 'Daigoro was just stabbed and Kenshin stepped forward to fight the leader while the others took care of the rest. The leader was defeated and shortly the police arrived and arrested the Beni Aoi. Back at Katsu\'s home, Tetsuma was caught, Katsu knew it was him looking for the map to the hidden money. Tetsuma try to reason why Katsu but it wasn\'t enough then he tried to fight him but Kenshin stepped in. Kenshin defeated Tetsuma and he then knew what he did was wrong and turned himself in.', 'Y', 'N', 7.1),
	('Samurai X', 'Yutaro Returns', 3, 21, 'Yes', 'Yes', 'NA', 21, 4, 1998, 'Yutaro returns back to the dojo with Professor Hans. Yahiko sees Yutaro and they have a friendly fight. Meanwhile the Black Knights are after professor Hans and want something from him. Since Yutaro is back Kenshin and everyone go to a restaurant and eat to celebrate Yutaro\'s return. The meal was finished and Professor Hans and Yutaro left, as Kenshin was leaving he noticed someone so he stayed behind. Professor Hans was attacked and a map was taken from him, he was badly injured and Yutaro couldn\'t do anything, Kenshin stepped in and fought one of the men but they retreated since they heard people calling Kenshin. Professor Hans was brought back to be treated and he told Yutaro that there\'s a map under the dojo and he must protect the divine medicine. Meanwhile the Black Knights had the map and were celebrating someone caused a ruckus and revealed them self.', 'Y', 'N', 6.8),
	('Samurai X', 'The Sanada Ninja Squad', 3, 22, 'Yes', 'Yes', 'NA', 5, 5, 1998, 'The Sanada Ninjas have joined the Black Knights in the search for the Divine Medicine but the Sanada Ninjas will take over Japan. Meanwhile Yutaro has Professor Hans note book and reads it, he soon finds out that there is a medicine that can possibly cure any illness. The Black Knights are elites in their field and can be dangerous, they are after the Divine Medicine so they can sell it and gain money and start to rule the world. Kenshin figures out that the Divine Medicine is somewhere in Suwa Sea so they take a trip there, trying to find any hints Kenshin asks local people questions. As they are moving, Sanada Ninjas attack Kenshin and the others, the Oniwabanshu helped and stopped the attack. The ninjas retreated and went back to base, the head leader of that group was getting annoyed of the outsiders and was arguing with the leader of the ninjas, the Black Knights step in and fight that particular group. Later on, Misao tags along with Kenshin and they get ready to get into Sanada\'s base.', 'Y', 'N', 6.3),
	('Samurai X', 'A Straying Journey', 3, 23, 'Yes', 'Yes', 'NA', 19, 5, 1998, 'Kenshin and the rest continue to use their hints and search for the divine medicine, suddenly Yahiko is unable to walk anymore, he had a fever. A hunter appeared and brought Yahiko in and treated him, he gave Kenshin some more clues as to where the divine medicine was, Yahiko got better and they left. After using all the hints Kenshin and the others were able to get into a cave and was on track, finally near the end, the path way was open. Soon the black knights arrive and including the leader of Sanada Ninja\'s, Misanagi. One thing that Yutaro was unable to read was the last paragraph and the floor collapsed and they fell into the ground.', 'Y', 'N', 6.5),
	('Samurai X', 'The Three Sanada Demons', 3, 24, 'Yes', 'Yes', 'NA', 26, 5, 1998, 'Kenshin and the rest fell underground and had no idea of what to do. Meanwhile Misanagi and the Black Knights enter the path way and begin to move toward the divine medicine. Later on, gas was leaking in and in less than half an hour Kenshin and the others would be goners. Sanosuke punched the wall and water came rushing out, because of that they were able to escape. Outside Yutaro found someone, it was a ninja named Kaita. He was injured and was going to die if not treated. Yutaro worked hard and treated Kaita\'s wounds, he woke up and helped them by using a shortcut so they could get caught up. Finally getting inside there were three guards, Zan, Ren and Baku, they attacked everyone and Ren was able to cancel out one of Kenshin\'s attack.', 'Y', 'N', 6.5),
	('Samurai X', 'Schneider\'s Bet', 3, 25, 'Yes', 'Yes', 'NA', 2, 6, 1998, 'Kenshin and Sanosuke continue to fight Zan and Ren while Baku is unnoticed. Sanosuke is having a bit of trouble but with the help of Kaoru, Sanosuke is able to defeat Zan. Kenshin\'s senses are being distorted and is having trouble with Ren, Kaita told Kenshin to attack the bats, after that everything was more clear, Ren and Baku were defeated shortly. A bat slowly flew away and tried to report back, Kenshin and the others followed it and found the divine medicine. Lieutenant Melder had betrayed Misanagi and Schneider would not put up with it so he fought Melder but got injured. Kenshin arrived and was going to fight Lieutenant Melder.', 'Y', 'N', 6.5),
	('Samurai X', 'The Two Guides', 3, 26, 'Yes', 'Yes', 'NA', 9, 6, 1998, 'Lieutenant Melder charges forward and attacks Kenshin, it would seem that Kenshin has a disadvantage and was injured badly, Melder continues to attack but creates a spark and ignites a flame with the oil on the ground, the divine medicine started to burn fast and Renz went to get a sample but Yahiko and Yutaro tried to stop him. Kenshin uses his succession technique and defeats Melder but was badly injured, Kaoru helped carry Kenshin to safety. Kaita helped defeated Renz and brought him to safety, Yutaro ran into the flames and grabbed a sample of the divine medicine, Sanosuke ran in and grabbed Yutaro out. The divine medicine was burned down and everyone got out except for Melder, Professor Hans recovered thanks to the medicine and received a report saying that the Black Knights have handed themselves over and the remaining Black Knights will be looked closely. Later on, Professor Hans and Yutaro are about to leave and Kenshin and the rest see them off.', 'Y', 'N', 6.4),
	('Samurai X', 'To My Angel Misao', 3, 27, 'Yes', 'Yes', 'NA', 16, 6, 1998, 'A day in the dojo where Yahiko is training, Yahiko is training with Misao and she\'s deciding it\'s about time she leaves. Omasu, Ochika and Aoshi arrive and are ready to take Misao back to Kyoto. Misao changes her mind and decides she doesn\'t want to go back, and then the females decide to go shopping. The females leave and Sanosuke and Yahiko are up to something, they believe that they are going to go and eat something without them so they tag along. The girls go shopping and bump into a pick pocket, they beat him up and get back their money. The pick pocket went and got all his men but they were defeated, meanwhile Kenshin and Aoshi talk and drink tea, they decide to take a walk and they see the girls.', 'Y', 'N', 6.6),
	('Samurai X', 'Feng Shui, Surprise Attack!', 3, 28, 'Yes', 'Yes', 'NA', 23, 6, 1998, 'Two competing clans of Feng Shui users create a powerful magic around the land that Tokyo sits in circa 1604. After 275 years, this magic begins to reactivate and cause disasters in Tokyo. After each of these incidents, a man claiming to be a Feng Shui master appears to provide advice to the victims. However, as soon as the man leaves a mysterious entrepreneur turns up to offer his services, such as warding stones inscribed with the power of Feng Shui. When the Akobeko catches fire from one of its stoves, Tae and Tsubame go to live at the Kamiya dojo, where they are attacked by Feng Shui fledglings following a visit from the entrepreneur, whose services Tae refused.', 'Y', 'N', 6.8),
	('Samurai X', 'The Magic Of Feng Shui', 3, 29, 'Yes', 'Yes', 'NA', 21, 7, 1998, 'The Fusui Master Jinpu had just saved Kenshin, they return back to the dojo and he explains everything. He shows Kenshin the map and tells him that his clan had an Eigou formation that would protect the town, the water clan also wanted a formation but the both would conflict, so they tried to destroy the Eigou formation. Now the water clan has come back and is creating their formation. It has already start and the water clan has attacked the dojo now the dojo and the restaurant is no longer needed and the formation has already begun.', 'Y', 'N', 6.5),
	('Samurai X', 'Tokyo Under Martial Law!', 3, 30, 'Yes', 'Yes', 'NA', 4, 8, 1998, 'Kaoru was injured and the only way to cure her is to go into the mountains and find the dragon fountain and get the water only then she will be cured. Jinpu creates a plan, he and Kenshin will go and get the water, Sanosuke and his friend will find some sort of statue and will destroy it and Yahiko will stay behind to protect Kaoru. So far everything has been successful Sanosuke is doing fine, and Kenshin and Jinpu are on their way. Meanwhile the water clan is slowly destroying the Eigou formation, Kenshin and Jinpu finally make it into the mountain and Kenshin grabs the water, the caves started to cave in and Kenshin and Jinpu got out. The Ryu Myaku started to move east of Musashino and the battle was not over yet.', 'Y', 'N', 6.5),
	('Samurai X', 'The Enemy Awaits In Senjo Gahara', 3, 31, 'Yes', 'Yes', 'NA', 18, 8, 1998, 'Kaoru was given the water and she started to recover, Kenshin and Jinpu left to Nikko to beat the Ryu Myaku before it was too late. Sanosuke and his friend went looking around for clues, finally they got possession of a book that gave many useful clues. It was hard to understand so Sanosuke and his friend went to find the author and he explained everything. Kenshin and Jinpu got to Nikko and the crest was gone, clues and hints were being pieced together and the water clan\'s plans started to become clearer. Sanosuke found Kenshin and Jinpu and explained everything, the Ryu Myaku would change direction so they went to Senjo Gahara.', 'Y', 'N', 6.7),
	('Samurai X', 'The Elegy Of Wind And Water', 3, 32, 'Yes', 'Yes', 'NA', 8, 9, 1998, 'Kenshin, Sanosuke and Jinpu went to Senjo Gahara and found the water clan, Jinpu went and attacked Reisui, and Reisui used his formation and proved to be more powerful than Jinpu. Meanwhile the author arrived and told the police and Sanosuke\'s friend to put the dragon statue in the center it will stop the Ryu Myaku. The Ryu Myaku had arrived and it was destroying the place, it hit the dragon statue but it was only weakened, Jinpu was able to stop it and the water clan was defeated as well as the Ryu Myaku. The police department slowly rebuilt their stations and Kenshin saw Jinpu off.', 'Y', 'N', 6.7),
	('Samurai X', 'End Of Wanderings', 3, 33, 'Yes', 'Yes', 'NA', 15, 9, 1998, 'It\'s peaceful times and everyone is carrying about their life, Kaoru and Kenshin leave to visit a graveyard, Yahiko is helping at the Akabeko and Sanosuke is helping Megumi so she can make something for him to eat. Kenshin and Kaoru visit the graveyard and do what they have to do, suddenly it started to rain so they went to a hotel to spend the night. Meanwhile Sanosuke took a long bath and Megumi washed his clothes and he was forced to wear something else, soon everyone went to sleep. Kaoru had dreams of Kenshin wandering off again, she awoke and it was morning, Kenshin wasn\'t there, she found him at the beach and they talked for awhile. They got on to the boat and set sail to return back home. The boat arrived back in Tokyo and everyone was waiting for Kenshin and Kaoru to get back.', 'Y', 'N', 7.2),
	('Seinfeld', 'The Seinfeld Chronicles', 1, 1, 'Yes', 'Yes', 'Yes', 5, 7, 1989, 'Jerry tells George about a woman named Laura he met in Michigan who is coming to New York for a seminar. Jerry wonders if she has romantic intentions. The two continue to talk about her after they leave the luncheonette. Jerry then receives a telephone call from Laura, who asks if she can stay overnight at his apartment. Jerry invites her, but is still unsure whether or not her visit is intended to be romantic. Jerry and Laura arrive at the apartment. Laura then receives a call and when Laura gets off the phone she tells Jerry: \'Never get engaged.\' Jerry then realizes that he has no chance with Laura, but has already committed himself to an entire weekend with her. ', 'Y', 'N', 7.9),
	('Seinfeld', 'The Stake Out', 1, 2, 'Yes', 'Yes', 'Yes', 31, 5, 1990, 'Elaine invites Jerry to a party where he meets a woman that fascinates him. However, Jerry knows nothing about her, not even her name, so he and George stakeout the lobby of her job in an attempt to \'run in\' to her. ', 'Y', 'N', 7.8),
	('Seinfeld', 'The Robbery', 1, 3, 'Yes', 'Yes', 'Yes', 7, 6, 1990, 'While out of town Jerry\'s apartment gets robbed (Kramer left the door open); so he considers moving. However, the apartment that George shows him is also an apartment that he wants, so they try to decide who will get it. Whoever wins, Elaine wants their apartment. Meanwhile, Kramer searches for the stolen property.', 'Y', 'N', 7.7),
	('Seinfeld', 'Male Unbonding', 1, 4, 'Yes', 'Yes', 'Yes', 14, 7, 1990, 'Jerry ponders a few courses of action when he sees that he no longer has anything in common with a clingy and obnoxious childhood friend. George has trouble with his latest relationship. Kramer has the idea to open a chain of make-your-own-pizza parlors and is looking for investors.', 'Y', 'N', 7.6),
	('Seinfeld', 'The Stock Tip', 1, 5, 'Yes', 'Yes', 'Yes', 21, 8, 1990, 'Jerry and George invest based on an insider stock tip, but then lose touch with their inside source. A nervous Jerry lets the declining stock ruin his weekend away with Vanessa, while George decides he\'s all in.', 'Y', 'N', 7.7),
	('Seinfeld', 'The Ex-Girlfriend', 2, 1, 'Yes', 'Yes', 'Yes', 23, 1, 1991, 'George has doubts about his current relationship that he broke off. Elaine is curious about a relationship that she has with a guy in her building that has degenerated over the past two years. Jerry is reluctantly drawn into George\'s ex-relationship when he picks up some books left at her apartment. Although he wants to break it off with her, she has this \'psycho-sexual\' hold over him and he becomes worried about what George might think if he lets this relationship develop. Elaine confronts the guy in her building and Jerry\'s relationship maybe in jeopardy when his girlfriend sees his act.', 'Y', 'N', 7.8),
	('Seinfeld', 'The Pony Remark', 2, 2, 'Yes', 'Yes', 'Yes', 30, 1, 1991, 'Jerry\'s parents come to town for a 50th anniversary party. Jerry bets Kramer that he won\'t complete his plans to renovate his apartment with levels in a month. Jerry takes Elaine to the dinner and he makes an observation about children who have ponies, this remark offends the guest of honor. When she dies soon afterwards, Jerry wonders if he should go to the funeral or go to his championship softball game. Elaine wonders about the fate of the apartment, when she hears the widower is moving to Arizona. George wonders if it will ever be possible for him to have sex again.', 'Y', 'N', 8.1),
	('Seinfeld', 'The Jacket', 2, 3, 'Yes', 'Yes', 'Yes', 6, 2, 1991, 'Jerry buys a real expensive new suede jacket with a colorful inner lining. George has a song from Les Miserables that he just can\'t get out of his mind. Kramer is supposed pickup a magician friend\'s doves, and needs someone to help him for two minutes; Elaine takes on the job. Kramer promises she\'ll get \'a lift\' to the hotel where Jerry and George are meeting her and her father, Alton Benes, an author cut from Hemingway cloth. Jerry and George suffer while waiting with Elaine\'s father. When it begins to snow, Jerry turns his new jacket inside out, to protect it, but Alton Benes doesn\'t want to be seen on the street with him.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Phone Message', 2, 4, 'Yes', 'Yes', 'Yes', 13, 2, 1991, 'George blows an invitation upstairs with his latest girlfriend and then when he tries to make restitution he leaves progressively nastier messages on her answering machine. He gets the chance to prevent her from hearing her messages by having Jerry switch the tape out of her machine, while he distracts her. Jerry and his girlfriend have a disagreement about a TV commercial for Dockers, and his telling his friends about their conflict.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Apartment', 2, 5, 'Yes', 'Yes', 'Yes', 4, 4, 1991, 'Kramer tries mousse in his hair. Jerry gets Elaine an opportunity to get the apartment right above him, before he realizes the possible implications. George tests the \'man with a wedding band\' theory of meeting women.', 'Y', 'N', 8.1),
	('Seinfeld', 'The Statue', 2, 6, 'Yes', 'Yes', 'Yes', 11, 4, 1991, 'Jerry has a box of stuff his grandfather left him. Inside is an interesting looking statue that could replace one George\'s parents had years ago, but he broke. George plans to pick the statue up later but in the meantime he tells his parents about the replacement statue. Meanwhile the boyfriend of a bitter Finnish author (whose latest work Elaine is going to edit) is going to clean Jerry\'s apartment. When Jerry returns to his apartment it is cleaned beyond reason. Later when Jerry and Elaine are at the author\'s apartment, they see the statue on her mantelpiece. Getting it back may jeopardize Elaine\'s chance at being an editor, but save George from his parent\'s wrath.', 'Y', 'N', 8.2),
	('Seinfeld', 'The Revenge', 2, 7, 'Yes', 'Yes', 'Yes', 18, 4, 1991, 'George quits his job in a huff after he is demoted to using the regular bathroom. Newman tells Kramer that he plans to jump off the building. Jerry suggests that George just go back into work next Monday morning and pretend like nothing happened; however, that doesn\'t work. Newman jumps, from the second floor. George plots revenge, and with Elaine\'s help, tries to slip his boss \'a Mickey.\' Jerry suspects that his launderer is a larcenist after he discovers that $1500 he had stashed in his laundry bag is missing. Kramer helps Jerry get revenge by bringing a bag of concrete in to put into one of the wash machines.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Heart Attack', 2, 8, 'Yes', 'Yes', 'Yes', 25, 4, 1991, 'George thinks he\'s had a heart attack. The doctor tells him otherwise, but he might want to get his tonsils and adenoids removed. Elaine is interested in the doctor and he is interested in her tongue. George not wanting to deal with the cost, follows Kramer\'s suggestion of going to a holistic healer. The healer\'s cure turns George purple and the ride to the hospital is delayed over a Chuckle.', 'Y', 'N', 8.2),
	('Seinfeld', 'The Deal', 2, 9, 'Yes', 'Yes', 'Yes', 2, 5, 1991, 'Jerry and Elaine are watching TV late at night and stumble across \'naked people\' and that gets them both discussing whether they could have a relationship and not jeopardize their friendship. George says it can\'t be done, but Jerry and Elaine devise \'a system\'; however, it develops a little trouble when her birthday comes along.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Baby Shower', 2, 10, 'Yes', 'Yes', 'Yes', 16, 5, 1991, 'Elaine needs to use Jerry\'s apartment to hold a baby shower for a woman that once dated George. George reflects that she was \'unequivocally the worst date of my life.\' Jerry has to go out of town for a show, so he lets Elaine use the apartment. Kramer sells Jerry on the idea on getting an illegal cable hookup. The party begins. The cable guys come to install the hookup. Jerry\'s show gets canceled, so he returns to the apartment with George (who\'s prepared to confront the bad date). Jerry is the victim of his own confrontation.', 'Y', 'N', 7.8),
	('Seinfeld', 'The Chinese Restaurant', 2, 11, 'Yes', 'Yes', 'Yes', 23, 5, 1991, 'Jerry, Elaine and George stop for a quick Chinese dinner before a showing of Plan 9 From Outer Space on the big screen. However, while waiting a really long time to get a table, Jerry sees a woman whose name he can\'t recall; George needs to use a phone he can\'t have and Elaine needs food, more than those seated ahead of them.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Busboy', 2, 12, 'Yes', 'Yes', 'Yes', 26, 6, 1991, 'George inadvertently meddles in the life of a busboy, by getting him fired. He tries to rectify things; however, he winds up compounding them by losing the busboy\'s cat. Elaine discovers that a week is much too long to have a houseguest. She does everything in her power to get him out. The busboy\'s life is saved and made for the better after his involvement with George, until he meets Elaine\'s houseguest.', 'Y', 'N', 7.9),
	('Seinfeld', 'The Note', 3, 1, 'Yes', 'Yes', 'Yes', 18, 9, 1991, 'Physical therapy proves painful for Jerry when his small talk with his therapist leads to a misunderstanding. Jerry uses his dentist friend, Roy, to write a note so that insurance will cover therapy for George and Elaine. Then, George\'s paranoia about men comes into play when he gets a massage from a man and later says \'I think it moved.\' Kramer thinks he has seen DiMaggio in Dinky Donuts. The notes may cause Roy to lose his license in an insurance fraud investigation.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Truth', 3, 2, 'Yes', 'Yes', 'Yes', 25, 9, 1991, 'George\'s relationship with a former IRS worker may ease Jerry\'s tax audit worries- until she becomes his former girlfriend. She wants to know why, so he tells her the truth, this was after he gave her Jerry\'s tax records. Elaine sees far too much of Kramer, he\'s dating her roommate; in return he saw far too much of her, in fact all of her. George tries to get Jerry\'s tax records back, but he finds she gone into a depression clinic.', 'Y', 'N', 8),
	('Seinfeld', 'The Pen', 3, 3, 'Yes', 'Yes', 'Yes', 2, 10, 1991, 'Elaine regrets accompanying Jerry on a trip to Florida to visit his parents. There are temperature control problems in the condo, a back breaking sofa bed, a slight overdose of muscle relaxants and the disposition of a pen that writes upside down.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Dog', 3, 4, 'Yes', 'Yes', 'Yes', 9, 10, 1991, 'Jerry is watching an unruly dog, for a fellow airline passenger who\'s sick in a hospital somewhere in Chicago. Jerry, can\'t leave his apartment, that leaves George and Elaine alone together. They find they have little to say to each other without their conversational third, Jerry; so they talk about him. Kramer tries breaking up with his girlfriend. Jerry can\'t locate the dogs owner, who was released from the hospital, some time ago.', 'Y', 'N', 7.4),
	('Seinfeld', 'The Library', 3, 5, 'Yes', 'Yes', 'Yes', 16, 10, 1991, 'The library asks Jerry about a book he checked out in 1971 and never returned, so Jerry looks up an old girlfriend for his defense against a library cop. George thinks the homeless man he\'d seen outside the library is a former high school gym teacher that he got fired. Kramer has his eye on a librarian. Elaine worries about her career when her boss hates the recommendations she made.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Parking Garage', 3, 6, 'Yes', 'Yes', 'Yes', 30, 10, 1991, 'Everyone separates to try to find the car in a huge parking garage. Jerry needs to use the bathroom so he finds a place to go and gets busted. Elaine tries to get help from people passing by. George joins Jerry in getting busted. Kramer is wearing \'the jacket,\' and forgets where he put down the air conditioner he was carrying and causes George to be really late for his parent\'s 47th anniversary.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Cafe', 3, 7, 'Yes', 'Yes', 'Yes', 6, 11, 1991, 'Jerry tries helping the owner of a small restaurant attract customers by giving him a suggestion. George must take an IQ test for his latest girlfriend, so Elaine helps him in \'a caper\' where she takes the test for him. Kramer tries to keep his mother\'s ex-boyfriend\'s jacket, because it helps him meet women; however the ex-boyfriend comes looking for it.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Tape', 3, 8, 'Yes', 'Yes', 'Yes', 13, 11, 1991, 'George is excited about a new potential baldness cure that was discovered in China. While listening to a tape of his previous nights show, Jerry hears the voice of a mysterious woman who talks dirty into his tape recorder and everyone becomes excited by the voice. Elaine shines in an entirely new light for George when he is let in on the her secret, she\'s the voice. He is later driven crazy when she plays around with him while goofing around in front of Kramer\'s new video recorder. George tries the bald cure. Kramer searches for the jacket.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Nose Job', 3, 9, 'Yes', 'Yes', 'Yes', 20, 11, 1991, 'Jerry\'s brain and penis play chess against one another to decide whether he should keep dating a vacuous model with whom the \'sex is great\' but not anything else. George is dating a woman with a big nose, Kramer tells her it like it is and she gets a nose job; however, there is a complication. Kramer gets Elaine to help him retrieve the jacket.', 'Y', 'N', 8.2),
	('Seinfeld', 'The Stranded', 3, 10, 'Yes', 'Yes', 'Yes', 27, 11, 1991, 'Jerry & Elaine go to a party with George, while there they send signals to each other to get out of bad party conversations. Afterward, George abandons them there, when he leaves with a co-worker he has a chance with. Jerry & Elaine keeping the hosts up real late, while waiting for Kramer to come and pick them up. The host later takes Jerry up on his offer to drop by when he is in the city, just as Jerry is leaving. He stays in Jerry\'s apartment for the evening and parties with Kramer and a lady of the evening. Later George pays the price for his romance in the workplace (he must quit) and he tries to shoplift at the drug store where he says they still owe him ten dollars.', 'Y', 'N', 7.7),
	('Seinfeld', 'The Alternate Side', 3, 11, 'Yes', 'Yes', 'Yes', 4, 12, 1991, 'Jerry\'s car is stolen and the criminal picks up his car phone. George decides to take a fill-in job moving cars from one side of the street to the other; this turns into a disaster for local traffic flow. Kramer gets a chance to do a line in a Woody Allen film; \'these pretzels are making me thirsty.\' Elaine gets tired of her 66-year-old boyfriend and when she is about to break up with him, he has a stroke.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Red Dot', 3, 12, 'Yes', 'Yes', 'Yes', 11, 12, 1991, 'Jerry is the unwitting cause of Elaine\'s boyfriend falling off the wagon. Elaine gets George a job, so he buys her a gift, an $85 cashmere sweater. The sweater has a little red dot on it; hence the price. Elaine gives it back, then George gives it to the cleaning woman, to keep her quiet about them having sex on his desk. George gets fired.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Subway', 3, 13, 'Yes', 'Yes', 'Yes', 8, 1, 1992, 'Everyone has an uncommon experience while going their separate ways on the subway. George meets a beautiful woman who distracts him from his intended destination, a job interview. Jerry falls asleep and then wakes up across from a fat naked man and winds up discussing with him, the New York Mets & Coney Island. Elaine\'s train stops in the middle of a tunnel on her way to be best man at a lesbian wedding. Kramer overhears a hot tip on a horse on his way to pay $600 in traffic violations.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Pez Dispenser', 3, 14, 'Yes', 'Yes', 'Yes', 15, 1, 1992, 'Kramer joins the \'Polar Bear Club.\' Jerry gets one of Kramer\'s Pez dispensers which makes Elaine laugh during a piano recital of George\'s girlfriend, and that puts their relationship in jeopardy. Kramer has an idea for a cologne that smells like the beach and suggests that George make a preemptive breakup with his girlfriend, that will give him the \'upper hand.\' The Pez dispenser has a remarkable effect during a drug confrontation.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Suicide', 3, 15, 'Yes', 'Yes', 'Yes', 29, 1, 1992, 'Elaine needs to fast before an x-ray, so she tries stuffing herself three days before the test. After his neighbor Martin tries suicide, Jerry is hit on by his girlfriend, Gina, while at the hospital. A psychic warns George to cancel his vacation to the Cayman Islands, but never can tell George why. Jerry becomes worried when Newman (a friend of Martins) sees him with Gina. Elaine starts hallucinating from hunger. Everything hinges on a Drake\'s coffee cake.', 'Y', 'N', 7.9),
	('Seinfeld', 'The Fix-Up', 3, 16, 'Yes', 'Yes', 'Yes', 5, 2, 1992, 'After selling each other on the idea, Jerry and Elaine sell George and Elaine\'s friend on a blind date, then they await the results. They promise to keep each other updated with \'full disclosure,\' though that doesn\'t happen. There also may be a problem with a defective condom. \'My boys can swim!\'', 'Y', 'N', 8.5),
	('Seinfeld', 'The Boyfriend - 1', 3, 17, 'Yes', 'Yes', 'Yes', 12, 2, 1992, 'Jerry meets Keith Hernandez and wants to make a good impression. Meanwhile, George is out of time on his unemployment and he works harder than ever on his scheme to get a 13 week extension. He tells the unemployment office he was really close on Vandelay Industries, a company that makes latex products and whose main office is Jerry\'s apartment. Kramer and Newman hate Hernandez back to a time when they were allegedly spit on by him; however, Jerry supports the \'second-spitter theory.\' Keith asks Jerry about Elaine\'s status. Keith makes a date with her and breaks a date with Jerry.', 'Y', 'N', 9.1),
	('Seinfeld', 'The Boyfriend - 2', 3, 18, 'Yes', 'Yes', 'Yes', 12, 2, 1992, 'George tries two more approaches with the unemployment officer. Kramer gets Jerry to accompany him to see a former neighbors\' new baby, \'you got to see the baby.\' Though he\'s gone out with Keith once, does that mean he must help him move. Elaine and Keith are hitting it off until he pulls out a cigarette. George wants to sleep with a really tall woman. Keith supports the \'second spitter theory.\' Jerry and Elaine both breakup with Keith and George might get his wish.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Limo', 3, 19, 'Yes', 'Yes', 'Yes', 26, 2, 1992, 'On a whim, Jerry and George take a limo from a passenger that Jerry knows never made it on the plane. While taking the limo they call Elaine & Kramer to join them for an event at Madison Square Garden, but it isn\'t the type of event they were hoping for.', 'Y', 'N', 9),
	('Seinfeld', 'The Good Samaritan', 3, 20, 'Yes', 'Yes', 'Yes', 4, 3, 1992, 'Jerry tracks down a hit-and-run driver, then he wants to date her, after dating her he finds out she hit another woman he\'s always wanted to date. George has an affair with Elaine\'s friend. Kramer has violent reactions to Mary Hart\'s voice.', 'Y', 'N', 8.1),
	('Seinfeld', 'The Letter', 3, 21, 'Yes', 'Yes', 'Yes', 25, 3, 1992, 'Kramer poses for a painting, that an elderly couple becomes just crazy about. George feels obligated to buy something when he accompanies Jerry to his new girlfriend\'s art studio. Elaine wears an Orioles baseball cap in the owner\'s box at Yankee Stadium and refuses to remove it. Jerry finds out his new girlfriend is a plagiarist after he hears the words she wrote in a letter, on television. Elaine gets a chance to return to Yankee Stadium.', 'Y', 'N', 8.1),
	('Seinfeld', 'The Parking Space', 3, 22, 'Yes', 'Yes', 'Yes', 22, 4, 1992, 'Kramer tells Jerry about something his friend Mike said about Jerry being \'a phony.\' After borrowing Jerry\'s car, Elaine comes up with a wild story, because the car is now making a strange clanking noise. George gets into a confrontation with Mike about a parking space in front of Jerry\'s apartment. Everyone on the street debates about parking etiquette.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Keys', 3, 23, 'Yes', 'Yes', 'Yes', 6, 5, 1992, 'Kramer invades Jerry\'s life too much, so Jerry revokes his spare key privileges. Realizing that he has broken the \'covenant of the keys\' gives Kramer the realization he is now free to come out of the shadows. Kramer takes off for California to follow his acting dream. Jerry gave his spare keys to Elaine, then when he needs them, he goes with George to Elaine\'s (who has her keys) to search for his spare set. What they find is Elaine\'s show-biz project. Kramer finds adventure as he journeys across the country to LA where he gets a famous bit part on Murphy Brown.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Trip - 1', 4, 1, 'Yes', 'Yes', 'Yes', 12, 8, 1992, 'With Elaine in Europe, Jerry asks George to accompany him on a trip to LA and The Tonight Show; while there they will try to locate Kramer. While auditioning, Kramer must deal with the advances of an older female landlord (an actress who hasn\'t worked since 1934) and get someone in Hollywood to read his script treatment. A body is discovered; the victim, a young woman, was strangled. Kramer meets a woman at an audition and he gives her a copy of his script. Jerry loses the correct phrasing for some new jokes and George tries to get Lupe, the chambermaid, to make his bed just right. At The Tonight Show, George disturbs the guests and Jerry bombs. The woman Kramer gave the script to is strangled and his script is found in her possession. Kramer\'s face is shown on the news as the prime suspect for the \'Smog Strangler,\' a serial-killer.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Trip - 2', 4, 2, 'Yes', 'Yes', 'Yes', 19, 8, 1992, 'Jerry and George try to contact the police to tell them Kramer is innocent. Kramer still doesn\'t know he\'s wanted. Jerry and George get a ride in a police car and while en route the officers pick up a possible 519. The 519 suspect is put in the back of the car with George and Jerry and they ask him tipping advice. Then all units are called in on Kramer\'s building, Jerry and George leave the police car door open and the 519 suspect escapes. While Kramer is in for questioning, another victim is found. He is let go and Jerry and George want to know what he is going to do, he is going to stay in LA. Jerry and George are back in New York and Kramer turns up like nothings changed.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Pitch', 4, 3, 'Yes', 'Yes', 'Yes', 16, 9, 1992, 'NBC executives ask Jerry to come up with an idea for a TV series. George decides he can be a sitcom writer and comes up with \'nothing.\' Kramer trades a radar detector for a helmet, later Newman gets a speeding ticket. While waiting to meet the NBC executives, George and Jerry meet Joe Davola, a writer and \'a total nut\' who goes to the same shrink as Elaine. Jerry searching for conversation, mentions Kramer\'s party, whereto Joe wasn\'t invited. While discussing the disaster of the meeting with NBC, George focuses on starting a relationship with the female NBC executive. Kramer shows his approval by throwing up on her. The helmet saves Kramer from an attack by \'Crazy\' Joe Davola. While all this is going on Elaine is in Europe with her shrink.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Ticket', 4, 4, 'Yes', 'Yes', 'Yes', 16, 9, 1992, 'Kramer suffers side effects from his head injury. NBC gives Jerry and George another meeting and on the way, Jerry throws out a watch his parents gave him. He then meets his Uncle Leo, who picks the watch out of the garbage. Kramer agrees to be an alibi for Newman\'s trial on a speeding ticket. George and Jerry meet with NBC executives and they give the go ahead for a pilot. Later they hide in the coffee shop, afraid of an attack from \'Crazy\' Joe. Elaine\'s shrink realizes that he didn\'t leave an extra prescription for Joe Davola, for the time while he\'s on vacation.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Wallet', 4, 5, 'Yes', 'Yes', 'Yes', 23, 9, 1992, 'Jerry\'s parents come to town to see a back specialist, they hear about \'Crazy\' Joe not liking Jerry and ask about the watch they gave him. George \'negotiates\' the deal with the NBC and gets a box of cigars from Susan\'s father. While at the doctor\'s office Morty\'s wallet is \'stolen.\' Elaine returns from her trip and tries to end her relationship with her shrink. The deal with NBC is lost.', 'Y', 'N', 8.2),
	('Seinfeld', 'The Watch', 4, 6, 'Yes', 'Yes', 'Yes', 30, 9, 1992, 'Jerry has dinner with his parents and Uncle Leo. Women, who\'s paying and the watch are all discussed. Elaine uses Kramer as \'her boyfriend\' in trying to fool her shrink. George gets Russell\'s address and tries to get the pilot reinstated. Jerry tries to buy back the watch. Outside her shrink\'s office, Elaine meets \'Crazy\' Joe, whom she begins to date.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Bubble Boy', 4, 7, 'Yes', 'Yes', 'Yes', 7, 10, 1992, 'Jerry\'s girlfriend, Naomi has a laugh that sounds like \'Elmer Fudd sitting on a juicer,\' and when she hears George\'s message to Jerry, she breaks up with him. So instead, Jerry asks Elaine to accompany him on a trip to a cabin in the mountain with George and Susan. Kramer isn\'t invited. Jerry agrees to a side trip to visit a sick fan, a \'Bubble Boy.\' George gets into a fight with the \'Bubble Boy\' over the correct answer to a Trivial Pursuit question. Kramer and Naomi also make the trip to the cabin and get the fire started.', 'Y', 'N', 9),
	('Seinfeld', 'The Cheever Letters', 4, 8, 'Yes', 'Yes', 'Yes', 28, 10, 1992, 'Jerry and George begin to work on the pilot for the series they pitched to NBC. Jerry says the wrong thing while \'messing\' around with one of Elaine\'s co-workers. George & Susan tell her father about the cabin fire, he becomes distraught and letters saved from the fire soon explain why. Kramer goes to the Cuban Embassy in search of cigars and makes a deal.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Opera', 4, 9, 'Yes', 'Yes', 'Yes', 4, 11, 1992, 'Crazy Joe leaves Jerry a message saying he will put the \'kibosh\' on him. Kramer has tickets for the opera, Pagliacci, and everyone is going including Elaine and her boyfriend \'Crazy\' Joe. Elaine drops in on Joe\'s apartment and is she surprised by what she discovers, so she maces him with cherry Binaca and ends their relationship. Susan can\'t attend, so George tries to scalp her ticket. Joe, a big fan of Pagliacci, comes to the opera in clown garb; Elaine and Jerry attend together not realizing their different estranged relationships with Joe.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Virgin', 4, 10, 'Yes', 'Yes', 'Yes', 11, 11, 1992, 'After much procrastination, George and Jerry strain to think of an idea for their TV series a few hours before a meeting with NBC executives. Jerry finds out a girl he once met is still a virgin, and later Elaine educates her about men after sex. George wants to end his relationship with Susan so he can exploit his writing profession as a pick-up line. Elaine runs into a Chinese delivery boy. Kramer watches too much television.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Contest', 4, 11, 'Yes', 'Yes', 'Yes', 18, 11, 1992, 'George\'s mother throws her back out when she falls down after catching him doing \'you know.\' When George says he\'ll never do it again, Jerry challenges him to a contest of self-denial, when he accepts, Elaine and Kramer want in on the action, or rather the lack of it.', 'Y', 'N', 9.6),
	('Seinfeld', 'The Airport', 4, 12, 'Yes', 'Yes', 'Yes', 25, 11, 1992, 'When their flight home gets canceled, Jerry & Elaine gets on another flight, the latter gets cramped into coach and Jerry parties in 1st class with a model. George and Kramer go between JFK and La Guardia to pick them up. When they settle on an airport George meets a convict and Kramer sees a man who owes him $240 from years ago.', 'Y', 'N', 9.1),
	('Seinfeld', 'The Pick', 4, 13, 'Yes', 'Yes', 'Yes', 16, 12, 1992, 'Elaine is humiliated when she accidentally shows a bit too much on her Christmas card photo, that she has sent out to everyone she knows. Jerry has a date with the model from the plane, she later dumps Jerry because of \'The Pick.\' George tries to reunite with Susan, but realizes it\'s a mistake, and uses \'The Pick\'. Kramer goes to Calvin Klein to complain about \'The Ocean,\' a fragrance they stole from him, and is asked to pose for a risque underwear advertisement.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Movie', 4, 14, 'Yes', 'Yes', 'Yes', 6, 1, 1993, 'Jerry tries to make two show dates and afterwards go to the movie theater to meet everyone. George gets in the wrong line for tickets. George, Elaine & Kramer decide to go to another theater to see the movie. Kramer waits outside for Jerry but also wants a hot dog. Jerry misses his first show, then goes to movie theater to tell everyone he won\'t make the movie, but no one is there. Through a comedy of errors, everyone (but Kramer) misses the movie, they were originally going to see.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Visa', 4, 15, 'Yes', 'Yes', 'Yes', 27, 1, 1993, 'George meets a Chinese female lawyer who thinks he is real funny; so he tells Jerry not to be funny around her, but she becomes attracted to this. Kramer returns early from baseball fantasy camp, where he accidentally punched Mickey Mantle. A mix-up with Jerry\'s mail causes Babu to be arrested for not renewing his visa. Jerry tries to get the lawyer to help Babu, but George\'s honesty when his relationship is threatened causes Babu to be deported and Elaine to still be sued by the delivery boy she hit.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Shoes', 4, 16, 'Yes', 'Yes', 'Yes', 4, 2, 1993, 'Jerry and George struggle to keep their idea for a TV series alive, one of their problems is they don\'t know how to do the Elaine character. Jerry meets an old girlfriend he never could kiss, later Kramer gets the opportunity. The ex-girlfriend talks about Elaine\'s shoes, mainly because she wants them. George is caught staring at the cleavage of the daughter of the NBC executive who is approving their script. Elaine\'s cleavage provides a means to turn the tables on him.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Outing', 4, 17, 'Yes', 'Yes', 'Yes', 11, 2, 1993, 'No thanks to Elaine, Jerry must work hard to prove he is straight when a college reporter mistakenly reports that he and George are gay, \'not that there is anything wrong with that.\' Things really get out of hand when the article is picked up by the New York Post.', 'Y', 'N', 9.4),
	('Seinfeld', 'The Old Man', 4, 18, 'Yes', 'Yes', 'Yes', 18, 2, 1993, 'Jerry, Elaine & George volunteer to help the elderly. Jerry gets assigned to a nasty old man. Elaine is repulsed by the goiter problems of hers and George depresses his charge. Kramer and Newman try the business of selling old records to a used record store. Jerry loses track of his man when they try to take him to the dentist to repair his dentures, after the man had bitten Kramer\'s arm.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Implant', 4, 19, 'Yes', 'Yes', 'Yes', 25, 2, 1993, 'Jerry dumps his girlfriend after Elaine says her figure is the result of implants. Kramer claims to have seen Salman Rushdie at the health club. By accident Elaine later discovers the breasts are real. George accompanies his current girlfriend to Detroit for her aunt\'s wake. While there he tries to get a copy of her death certificate so he can get a 50% discount on the airfare.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Junior Mint', 4, 20, 'Yes', 'Yes', 'Yes', 18, 3, 1993, 'Jerry has a date with a woman whose name he has forgotten, but it \'rhymes with a female body part.\' Could it be \'Mulva\'? Elaine visits an old boyfriend who\'s in the hospital for an operation; he was once fat, thin she\'s interested again. Kramer gets an opportunity to witness the operation and he drags Jerry along, while watching they have an accident with a \'Junior Mint.\'', 'Y', 'N', 9),
	('Seinfeld', 'The Smelly Car', 4, 21, 'Yes', 'Yes', 'Yes', 15, 4, 1993, 'The strong body odor of a valet is left in Jerry\'s car. George can\'t believe it when he spots Susan holding hands with another woman. Elaine loses her current boyfriend and Jerry is forced to try to sell the car, because the odor has taken a life of its own and permeated everything. George is turned by Susan\'s new outlook on life. Susan\'s friend is swayed to heterosexuality by Kramer, though later turned back off by a whiff of a jacket that Kramer borrowed from Jerry. When the car can\'t be sold, Jerry winds up leaving it and the keys out on the street.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Handicap Spot', 4, 22, 'Yes', 'Yes', 'Yes', 13, 5, 1993, 'Going out to buy an engagement party present for \'The Drake,\' George parks his father\'s car in a handicap parking spot, after taking Kramer\'s advice. An angry mob trashes the vehicle when a disabled woman gets injured, because of the illegal parking. While visiting the woman at the hospital, Kramer falls in love and feels compelled to replace the wheelchair. George becomes his father\'s butler after his father gets arrested for parking in the spot.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Pilot - 1', 4, 23, 'Yes', 'Yes', 'Yes', 20, 5, 1993, 'Jerry and George get the green light to produce Jerry, the pilot for the series based on their \'nothing\' lives. Russell Dalrimple, the president at NBC behind the pilot, is obsessed with Elaine. George is obsessed with a white spot on his lip and a box of raisins taken by actor playing Kramer. The real Kramer has an internal plumbing problem and on his way to fix it, he gets delayed and is caused to \'miss his chance.\' Jerry has an audition with the new \'Elaine,\' a method actress interested in being Elaine in every way. The real Elaine has a problem with the coffee shop, they appear to be only hiring buxom waitresses, so she tries to get hired and files a report.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Pilot - 2', 4, 24, 'Yes', 'Yes', 'Yes', 20, 5, 1993, 'Rehearsals for the pilot begin. Russell\'s obsession with Elaine begins to affect his work. George asks TV Kramer about the raisins. The real Kramer might be forced to work on his plumbing problem by using the \'dreaded apparatus.\' Elaine gets an investigation started on the owner of the diner. George gets the results of the biopsy of his white spot. At the taping of the pilot, Elaine sneaks in disguised and \'Crazy\' Joe jumps out of the audience. Elaine finds Morty\'s wallet in Jerry\'s couch. Everyone from the past season comments on the pilot as it\'s broadcast, they all think it\'s great. When Russell disappears, the fate of the pilot is in the hands of the new president, a person convinced that Jerry can\'t act.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Mango', 5, 1, 'Yes', 'Yes', 'Yes', 16, 9, 1993, 'George tells Jerry about his lack of confidence below \'the equator.\' Jerry begs Elaine for another chance when he finds out she faked her orgasms. Kramer gets banned from his favorite fruit shop.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Puffy Shirt', 5, 2, 'Yes', 'Yes', 'Yes', 23, 9, 1993, 'George is forced to move in with his parents. He gets a job as a hand model and becomes obsessed with keeping his hands safe. Kramer\'s girlfriend, who designs clothes and talks with a real low voice, asks Jerry a question that he politely answers yes to. He agrees to wear one of her new puffy pirate shirts on a Today Show appearance he is making.', 'Y', 'N', 9.1),
	('Seinfeld', 'The Glasses', 5, 3, 'Yes', 'Yes', 'Yes', 30, 9, 1993, 'George\'s glasses are stolen and he needs a new pair, so he goes to see Kramer\'s friend to get a thirty percent discount; all Elaine gets is bitten by a dog and then she becomes afraid of them. While not wearing his glasses, George thinks he sees Jerry\'s girlfriend kissing Jerry\'s cousin and Jerry tries to figure out if it\'s true.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Sniffing Accountant', 5, 4, 'Yes', 'Yes', 'Yes', 7, 10, 1993, 'George\'s father gets him an interview as a bra salesman. Evidence points to Jerry\'s accountant being a drug user. So Jerry, Kramer and Newman set out to find out the truth. Elaine\'s new boyfriend is perfect except for his use of an exclamation point.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Bris', 5, 5, 'Yes', 'Yes', 'Yes', 14, 10, 1993, 'George gets a great parking spot that becomes a target. Kramer thinks that he has stumbled on the product of a genetic engineering experiment, a \'pig man.\' Elaine and Jerry are nervous about the religious duties they must do when they agree to become godparents to a couple\'s newborn, including getting the Mohel and holding the baby for the circumcision.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Lip Reader', 5, 6, 'Yes', 'Yes', 'Yes', 28, 10, 1993, 'Jerry is smitten with a line judge at the US Open, but after he gets her attention, he finds out she is deaf. Elaine has a problem not communicating with a limo driver. George wants to use Jerry\'s girlfriend to read the lips of his ex-girlfriend to find out what she is saying about him. While she is reading the lips, Kramer does the translation, that gets George in more trouble. Kramer becomes a ball man at the Open, when Monica Seles returns to tennis.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Non-Fat Yogurt', 5, 7, 'Yes', 'Yes', 'Yes', 4, 11, 1993, 'When they begin to gain weight, Jerry and Elaine suspect that Kramer has made a bad investment in a non-fat yogurt shop. Jerry inadvertently uses the \'F\' word, as a result so does Meredith\'s son Matthew, a lot. George meets an old childhood friend whom he is convinced is trying to humiliate him. Elaine begins dating this friend and gives him an idea for his mayoral candidate\'s campaign. Kramer\'s date with a lab technician results in strange test results for the future mayor of New York City.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Barber', 5, 8, 'Yes', 'Yes', 'Yes', 11, 11, 1993, 'George is uncertain about whether his job interview was successful or not, so he decides to go into the office and act like an employee while the boss is on vacation. Jerry is reluctant to dump his old barber even when he is given a real bad haircut. Kramer arranges to get him a clandestine haircut at the apartment of his barber. Newman is charged by Jerry\'s barber to get a sample of Jerry\'s hair when he suspects foul play.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Masseuse', 5, 9, 'Yes', 'Yes', 'Yes', 18, 11, 1993, 'Elaine meets a man who\'s perfect except his name is the same as a notorious serial killer. Jerry is frustrated when he can\'t get his girlfriend, who\'s a masseuse, to give him a massage, even Kramer is a customer. George is obsessed when Jerry\'s girlfriend doesn\'t like him, so he tries extra hard to get her to like him, much to his own girlfriend\'s dismay.', 'Y', 'N', 8.1),
	('Seinfeld', 'The Cigar Store Indian', 5, 10, 'Yes', 'Yes', 'Yes', 9, 12, 1993, 'Jerry helps George out with a coffee table stain and makes Elaine take the subway home and gives her Mr. Costanza\'s TV Guide to read. While on the train, Elaine meets a strange man obsessed with television. George meets a woman at a refinishing store who he brings back to his parent\'s home and passes it off as his. A female Native American that he is interested in thinks Jerry is racially insensitive when he presents Elaine with a cigar-store Indian as a peace offering. George gets grounded when his parents return from vacation and find a prophylactic wrapper in their bed and a missing TV Guide. Kramer has an idea for a coffee table book on coffee tables that Elaine doesn\'t like but Mr. Lippman does.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Conversion', 5, 11, 'Yes', 'Yes', 'Yes', 16, 12, 1993, 'George changes his religion to Latvian Orthodox to keep his girlfriend who must break up with him for religious reasons. Jerry finds a tube of fungus cream in his girlfriend\'s medicine cabinet and fakes an illness until he can figure out what the cream is used for. He asks Elaine to ask her current boyfriend who\'s a podiatrist. Kramer meets a sister at George\'s new church who becomes infatuated with him.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Stall', 5, 12, 'Yes', 'Yes', 'Yes', 6, 1, 1994, 'While in a bathroom stall, Elaine needs some toilet paper, but the woman in the next stall refuses to give her a piece. The woman is Jerry\'s girlfriend whose voice Kramer recognizes from a telephone sex line. Elaine\'s boyfriend, whose face she just loves, takes George & Kramer rock climbing. After his accident, Elaine isn\'t sure his face will be the same.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Dinner Party', 5, 13, 'Yes', 'Yes', 'Yes', 3, 2, 1994, 'The gang struggles to find gifts for a dinner party. Jerry and Elaine stop at a bakery to get a cake, but they forget to take a number and lose the chocolate pastry and the one they get has a hair on it. Kramer and George try to get the wine but must get change for a $100 dollar bill and wait for a double-parker to return to his car.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Marine Biologist', 5, 14, 'Yes', 'Yes', 'Yes', 10, 2, 1994, 'Jerry meets an old college classmate who asked about George, whom Jerry says is now a \'marine biologist.\' An infuriated Russian writer tosses an electronic organizer belonging to Elaine out of a limousine that hits a passerby on the head. Kramer struggles with his golf swing and sand. While walking along the beach, George is called on to use his marine biology skills to save a whale.', 'Y', 'N', 9.3),
	('Seinfeld', 'The Pie', 5, 15, 'Yes', 'Yes', 'Yes', 17, 2, 1994, 'Jerry can\'t believe that his girlfriend won\'t share a piece of pie with him. There is a mannequin at a store that looks like Elaine and she wants to know where it came from. George is interested in a suit that he makes an enemy over. Kramer has an itch. George\'s new suit makes a noise.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Stand-In', 5, 16, 'Yes', 'Yes', 'Yes', 24, 2, 1994, 'Kramer talks his stand-in friend, a \'little person\', into getting lifts to keep his job. Jerry visits a sick friend, who\'s in need of a good laugh, at the hospital. George and his latest girlfriend have nothing to say to each other, he wants to break up, but won\'t when he finds out she is being urged to break it off. One of Jerry\'s friends \'takes it out\' while on his first date with Elaine. Jerry\'s friend takes a turn for the worse after his first visit, so he tries again.', 'Y', 'N', 8.1),
	('Seinfeld', 'The Wife', 5, 17, 'Yes', 'Yes', 'Yes', 17, 3, 1994, 'A girlfriend poses as Jerry\'s wife so she can get a dry cleaning discount. George uses the shower at the health club as a bathroom and is afraid of being turned in after being seen. Elaine is getting mixed signals from a male friend who may be interested. Kramer\'s getting ready to impress his girlfriend\'s parents.', 'Y', 'N', 8.2),
	('Seinfeld', 'The Raincoats - 1', 5, 18, 'Yes', 'Yes', 'Yes', 28, 4, 1994, 'Jerry\'s parents are staying with him while they wait to take their trip to Paris and he\'s just returned from three weeks on the road can\'t get anytime alone with his girlfriend. George tries to get out of the big brother program, just after he gets talked into it. The Seinfelds avoid the Costanza\'s dinner invitation. Elaine\'s latest boyfriend, who\'s a \'close talker,\' becomes unusually fixated on Jerry\'s parents and shows them New York City. Kramer makes a deal with Jerry\'s father to sell belt-less raincoats to a secondhand shop and George sells his father\'s moth-ridden cabana style clothing, right before they plan a cruise.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Raincoats - 2', 5, 19, 'Yes', 'Yes', 'Yes', 28, 4, 1994, 'Jerry and his girlfriend get some time alone with each other at a movie, Schindler\'s List, they don\'t see it; however, Newman sees it and them. A delay in the shipment of the raincoats will make the Seinfelds miss their flight to France, George uses this as an opportunity to get his \'little\' brother back to his father. The Seinfelds manage to avoid meeting the Costanzas in New York City.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Fire', 5, 20, 'Yes', 'Yes', 'Yes', 5, 5, 1994, 'Kramer is dating one of Elaine\'s co-workers, a woman who drives her crazy. Kramer brings her to one of Jerry\'s shows, where she heckles him relentlessly; unfortunately there is a national magazine critic in the audience. George panics when there is a fire at his girlfriend\'s apartment, during her son\'s birthday party. Jerry decides to get revenge by heckling the woman where she works. She runs out of the office onto the street and loses her pinkie toe. Kramer finds the toe, takes a bus to the hospital and saves the passengers from a gunman. Inspired by Kramer\'s tale, George tries to confront his feelings of cowardice.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Hamptons', 5, 21, 'Yes', 'Yes', 'Yes', 12, 5, 1994, 'Everyone makes a trip to the Hamptons to \'see the baby\' and enjoy the weekend. George\'s girlfriend goes topless and everyone sees her chest before he does. \'The baby\' is the most hideous thing they\'ve ever seen. Elaine is confused when a handsome doctor refers to her as \'breathtaking\' - the same term he later uses to describe the baby. Kramer finds a filled lobster trap. Jerry\'s girlfriend sees George naked, after he\'s just gotten out of the pool, so something isn\'t as it should be.', 'Y', 'N', 9.2),
	('Seinfeld', 'The Opposite', 5, 22, 'Yes', 'Yes', 'Yes', 19, 5, 1994, 'George comes to the realization that he should try to do the opposite of everything, so he does, his luck changes and everything begins to go his way including getting a girlfriend, a job with the Yankees and moving out of his parents\' house. Things begin to be unlucky for Elaine after she buys a box of \'Jujyfruits.\' Kramer appears on Regis & Kathie Lee to promote his coffee table book. Rachel wants to break up with Jerry and he readily agrees, because his luck has been \'even Steven.\' Elaine\'s eating of \'Jujyfruits\' causes Pendant Publishing to go under, and later she realizes that she and George have traded places.', 'Y', 'N', 9.5),
	('Seinfeld', 'The Chaperone', 6, 1, 'Yes', 'Yes', 'Yes', 22, 9, 1994, 'Jerry gets a date with Miss Rhode Island, a Miss America contestant; when they need a chaperone Kramer is available. On the date, Kramer gives her advice and becomes her personal coach. Elaine tries to get a job at Doubleday, filling in the shoes once filled by Jackie Onassis; instead she gets a job being the personal assistant of a top executive who likes white socks. Meanwhile, George decides that the Yankees need to change their uniforms from polyester to cotton.', 'Y', 'N', 8.2),
	('Seinfeld', 'The Big Salad', 6, 2, 'Yes', 'Yes', 'Yes', 29, 9, 1994, 'Elaine\'s boss wants a special mechanical pencil, so Elaine tries to get one from a stationary store where the clerk has a thing for her. George and his girlfriend pick up a \'big salad\' for Elaine, that his girlfriend gives to Elaine and she thanks her. Later, George points out that he bought the \'big salad.\' Jerry discovers that his current girlfriend once dated Newman, who broke off his relationship with her. Kramer plays golf with an ex-ball player who breaks a rule of golf, they have a fight, and later the ball player is wanted for questioning in the murder of a dry cleaner, where a golf tee was involved. Kramer later helps him evade the police in a white Ford Bronco.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Pledge Drive', 6, 3, 'Yes', 'Yes', 'Yes', 6, 10, 1994, 'Jerry comments that a friend was hitting on him and Elaine tries to find out if what was true, but gets the voice of the woman and her current boyfriend confused. Elaine\'s boss eats his Snickers bar with a knife and fork and idea that soon catches on. George thinks a waitress gave him the finger. Jerry gets caught throwing away a thank you card. Jerry cashes some old birthday checks from his grandmother. Jerry\'s working a PBS pledge drive and gets George to bring a Yankee to appear with him, while en-route to the studio, someone gives George the finger.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Chinese Woman', 6, 4, 'Yes', 'Yes', 'Yes', 13, 10, 1994, 'Jerry and Elaine see George\'s father with a man with a cape but don\'t say hello. Jerry discovers a Chinese woman on George\'s phone line after the wires get crossed and he gets a date with her. Kramer gets worried about his sperm count, so he goes to a fertility clinic and then makes a change in his choice of undergarments. Elaine ruins her friend Noreen\'s latest romance with a long talker. The Chinese woman turns out to be Jewish and from Long Island. Estelle gets advice about her relationship with Frank from the Chinese woman, but discounts it when she meets her. George\'s life is made miserable when his parent\'s separate.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Couch', 6, 5, 'Yes', 'Yes', 'Yes', 27, 10, 1994, 'Elaine begins to date the guy who delivers Jerry\'s new couch. Kramer plans to start the pizza business he thought of back in \'Male Unbonding\' with Poppie. George joins a book club, but tries to rent the movie so he can bluff his way through the meeting. Jerry and Elaine\'s discussion of the abortion issue causes trouble for Poppie, Elaine\'s relationship & Jerry\'s new couch. George spends the evening with the family that has rented the film.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Gymnast', 6, 6, 'Yes', 'Yes', 'Yes', 3, 11, 1994, 'George and Kramer convince Jerry he\'ll be missing out on something if he stops dating a Romanian Olympic gymnast. Jerry and Kramer find out about one of George\'s bathroom habits. Kramer must pass a kidney stone. The mother of George\'s girlfriend sees him eat something out of a trash bin, later cleaning a windshield & one of his bathroom habits. Elaine\'s boss becomes obsessed with finding the image in a 3-D painting, so he sends her to represent him in a huge merger deal.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Soup', 6, 7, 'Yes', 'Yes', 'Yes', 10, 11, 1994, 'Elaine brings over a man she met in England and he turns out to be a real bounder. Jerry accepts an Armani suit from an obnoxious comedian, the only condition, he must treat him to a meal at a restaurant; however, what makes up a meal. George goes for a walk with a waitress from Monk\'s and manure in the path sums up his relationship with her. After his kidney stone, Kramer decides to eat only fresh foods.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Mom & Pop Store', 6, 8, 'Yes', 'Yes', 'Yes', 17, 11, 1994, 'A salesman convinces George to buy a convertible once owned by \'Jon Voight.\' Kramer tries to save a small shoe-repair business, but his good intentions affect Jerry in a big way. Elaine wins tickets for Mr. Pitt, who\'s always wanted to participate in the Macy\'s Thanksgiving Day Parade.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Secretary', 6, 9, 'Yes', 'Yes', 'Yes', 8, 12, 1994, 'Jerry confronts his dry cleaner, whom he spotted wearing a jacket that he brought in for cleaning. George passes over hiring an attractive secretary for a less attractive one, he thinks he\'ll be able to get some work done; however, the secretary\'s efficiency turns him on, so he gets her a raise and then she makes more than he does. Kramer gets Uma Thurman\'s phone number and sells Bania his suit at a women\'s clothing store then he hides in a dressing room until he can get some clothing. At this same store, Elaine tries to buy a dress, but is unsatisfied with the size of the mirrors in the store.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Race', 6, 10, 'Yes', 'Yes', 'Yes', 15, 12, 1994, 'Through his current girlfriend, Lois, Jerry meets an old rival, who suspects that he cheated in a high school race and he wants a rematch with Jerry to prove he was faster. Elaine is put on a \'blacklist\' for Chinese food delivery and finds out her boyfriend is a Communist. George responds to a personal ad in a Communist newspaper while at work, when Steinbrenner hears about it, he wants to see George in his office. Through his friend Mickey, Kramer becomes a department store Santa, who later spouts out Communist propaganda.', 'Y', 'N', 9.1),
	('Seinfeld', 'The Switch', 6, 11, 'Yes', 'Yes', 'Yes', 5, 1, 1995, 'Elaine lets a potential employer borrow Mr. Pitt\'s tennis racket, but the injury suffered may ruin her chances, especially when she must get his racket back. Jerry\'s girlfriend never laughs, but he meets her roommate who does, so Jerry decides he would like to make \'the switch.\' George\'s model girlfriend may be bulimic. He needs proof, so he meets Kramer\'s mother, who\'s a bathroom matron. While there he finds out Kramer\'s first name, Cosmo. Kramer decides it is time to be himself and begins to use his first name. George has the perfect plan for \'the switch,\' a menage a trois.', 'Y', 'N', 9.1),
	('Seinfeld', 'The Label Maker', 6, 12, 'Yes', 'Yes', 'Yes', 19, 1, 1995, 'Elaine and Jerry are suspicious of a friend\'s gift, when a gift Elaine gave him, a label maker, is given to Jerry in return for some Superbowl tickets Jerry has but can\'t use because \'The Drake\' is getting married on Superbowl Sunday and he is in the wedding party. George convinces his girlfriend to get her male roommate to move out, that he soon regrets. Kramer takes playing a game of Risk against Newman seriously. The Superbowl tickets pass through several hands and Jerry sees the game with his worst nightmare.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Scofflaw', 6, 13, 'Yes', 'Yes', 'Yes', 26, 1, 1995, 'George meets an old friend who\'s spent the last few months undergoing chemotherapy, that everyone knew except him. Kramer calls a litterbug \'a pig\' near a cop who\'s on a quest to catch a longtime parking ticket scofflaw. Kramer wanting to change his image, asks Elaine where her old boyfriend got his glasses. He goes to see him at a book signing and says hi for Elaine, that means that she has lost the \'upper hand\' in their breakup, so she confronts him and then gets even by getting a copy of his glasses. George finds out from Gary, that he lied about his cancer and has been taking advantage of Jerry\'s kindness. Kramer discovers the identity of \'the scofflaw.\' George gets a toupee.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Highlights Of 100 - 1', 6, 14, 'Yes', 'Yes', 'Yes', 2, 2, 1995, 'Jerry introduces a program that shows highlights from the first 99 episodes of a \'show about nothing.\'', 'Y', 'N', 7.5),
	('Seinfeld', 'The Highlights Of 100 - 2', 6, 15, 'Yes', 'Yes', 'Yes', 2, 2, 1995, 'Jerry introduces a program that shows highlights from the first 99 episodes of a \'show about nothing.\' ', 'Y', 'N', 7.5),
	('Seinfeld', 'The Beard', 6, 16, 'Yes', 'Yes', 'Yes', 9, 2, 1995, 'Elaine tries to convert a gay man to heterosexuality. George, who\'s now wearing his toupee, discovers that the woman Kramer has set him up with, is bald. Kramer gives a homeless man some Chinese food and begins standing in police lineups for $50 a lineup. Jerry begins to date a cop, but she wants him to take a lie detector test, she thinks he is lying about NOT watching Melrose Place.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Kiss Hello', 6, 17, 'Yes', 'Yes', 'Yes', 16, 2, 1995, 'Elaine\'s friend, a physical therapist, whom Jerry must \'kiss hello,\' has an old style hairdo, that Jerry and Elaine want Kramer to comment on. Jerry\'s grandmother wants him to open a ketchup bottle and she tells a story about some money that Uncle Leo was supposed to give his sister. Jerry\'s father is anxious to collect the money and interest Leo owes. Kramer puts tenant pictures up in the lobby and soon Jerry is giving every woman in the building, the \'kiss hello\'; however, when he stops, he becomes unpopular. George gets his arm looked at, misses a follow up appointment and must pay for that visit. The therapist skips out on her patients, including George, and goes skiing with Elaine. After their trip, she drops Elaine off 3 blocks from her apartment. Elaine injures her shoulder carrying her equipment home, and can\'t get any complementary treatment. Jerry gets proof of his uncle\'s dishonesty.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Doorman', 6, 18, 'Yes', 'Yes', 'Yes', 23, 2, 1995, 'The doorman in Mr. Pitt\'s building, cause\'s trouble for Jerry who was only trying to be nice. Kramer robs George on the street for some German tourists. George\'s father is living with him and when he removes his shirt, George and Kramer see that he has breasts. So, Kramer develops a new undergarment for males (\'The Bro\' or \'The Manssiere\') that will alleviate this problem. Jerry offers his soiled couch to replace the one that was stolen while he was \'on duty.\'', 'Y', 'N', 8.6),
	('Seinfeld', 'The Jimmy', 6, 19, 'Yes', 'Yes', 'Yes', 16, 3, 1995, 'The guys play a game of basketball with \'the Jimmy,\' a man who talks about himself in the third person. Jimmy sells odd shaped training shoes and George is an interested investor. Fresh from the gym, he attends a Yankees meeting about thefts, during which he sweats profusely. Jerry goes to the dental office and discovers they now carry Penthouse in the waiting room. Elaine gets tickets to a benefit for the AMCA (Able Mentally Challenged Adults) featuring Mel Torme, the \'Velvet Fog.\' Elaine tries to meet a handsome guy at the gym, but instead talks with \'the Jimmy,\' who makes the date for himself. On a follow-up visit to the dental office, Jerry feels the dentist and his hygienist may have lived out a fantasy during his time in the chair, the type of thing you might read in Penthouse. Kramer has a visit to the dentist complete with Novocain, later while wearing a pair of Jimmy\'s shoes, winds up getting a him a seat at the main table of the benefit.', 'Y', 'N', 9.1),
	('Seinfeld', 'The Doodle', 6, 20, 'Yes', 'Yes', 'Yes', 6, 4, 1995, 'Jerry is disgusted when he finds out he was eating pecans that were just in his girlfriend\'s mouth. George finds a doodle that his girlfriend drew of him. Kramer is eating some tasty peaches that come in season for two weeks every year. Fleas force Jerry and his visiting parents out his apartment. Elaine has an interview with a publisher that has suite of rooms at a fancy hotel and that is where Jerry parents get to stay. Jerry stays with his girlfriend. Elaine must go into Jerry\'s fumigated apartment to get an unpublished manuscript that she is supposed to read for her interview and she can\'t find it, but Kramer read it in Jerry\'s apartment and the gas causes him to lose his sense of taste. George finds out that his girlfriend really doesn\'t care what he looks like. Jerry figures out that Newman gave him the fleas. Meanwhile, Jerry\'s parents, Uncle Leo and Nana live high on the hog at the hotel.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Fusilli Jerry', 6, 21, 'Yes', 'Yes', 'Yes', 27, 4, 1995, 'Estelle is getting an eye job. Kramer gets his new license plates from the DMV, but the plates say \'ASSMAN.\' Jerry is disturbed when he finds out his mechanic used his \'move\' on Elaine while making love to her. Kramer makes a statue of Jerry out of fusilli pasta and he makes the most of his new license plates. Jerry confronts his mechanic and later requires his services. Frank becomes the unwitting victim of one of those \'freak\' accidents proctologists are always telling stories about.', 'Y', 'N', 9),
	('Seinfeld', 'The Diplomat\'s Club', 6, 22, 'Yes', 'Yes', 'Yes', 4, 5, 1995, 'After his quick trip to Ithaca, Jerry plans to meet a super model at an airport club, but his assistant, Katie, makes the trip a nightmare. Elaine says she will quit working for Mr. Pitt, but finds out that she\'s going to be in his will. She becomes a suspect when he overdoses his medication. George tries to prove to his boss that he is not a racist, when he says his boss looks like \'Sugar\' Ray Leonard. To prove it, he tries to find anyone who\'s black that will be his friend. While at the airport club, Kramer meets a rich Texan with whom he starts making bets. Kramer hasn\'t gambled in three years and when he begins to lose, he calls in Newman for reinforcement.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Face Painter', 6, 23, 'Yes', 'Yes', 'Yes', 11, 5, 1995, 'George and his girlfriend discuss toilet paper and he is in love. Elaine\'s boyfriend paints his face and his behavior at a hockey game, disturbs Jerry, Elaine and a passing priest. A monkey throws a banana peel at Kramer, when he throws it back, the monkey becomes depressed and the zoo demands an apology. George tries to tell his girlfriend that he loves her, but her reaction surprises him. Jerry refuses to give the \'necessary\' follow-up courtesy thank you for the hockey tickets and Kramer is outraged.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Understudy', 6, 24, 'Yes', 'Yes', 'Yes', 18, 5, 1995, 'George and Jerry are suspected, by the cast and Kramer, of deliberately injuring Bette Midler during a softball game, giving Jerry\'s girlfriend, Bette\'s understudy, a chance to perform. Kramer becomes Bette\'s personal assistant. Elaine gets George\'s father to translate for her when she suspects that her manicurist has made some obvious snide remarks in a foreign tongue. While crying about losing her manicurists, Elaine meets the owner of a catalog, J. Peterman, and gets herself a new job.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Engagement', 7, 1, 'Yes', 'Yes', 'Yes', 21, 9, 1995, 'Jerry and George reevaluate their relationships with women, so they make \'a pact\' to change their ways, though Jerry doesn\'t know it. Elaine has a problem sleeping in her new apartment because of a nearby constantly barking dog; Kramer recommends a solution. George gets back with Susan, his former girlfriend from NBC; he asks her to marry him, and after a couple hours of convincing she says yes. Kramer, his solution (Newman) and Elaine commit a dognapping and take the dog far out of the city. Jerry breaks up with his girlfriend again; however, George is now trapped in his relationship with Susan, almost to the point where he is married already. Elaine almost gets a good night of sleep.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Postponement', 7, 2, 'Yes', 'Yes', 'Yes', 28, 9, 1995, 'Elaine\'s dog problem is solved by a neighborly rabbi with a cable show. Kramer\'s involvement in the dognapping worries him when he finds out about its impact on his permanent record. Overwhelmed with it all, George decides he wants to postpone the engagement. Elaine isn\'t \'concerned\' with George\'s intentions, but is really jealous that he\'s the first of the group to get engaged. The neighborly rabbi offers advice on her problem, that he later relates to Jerry and anyone else who\'ll listen. Kramer and Jerry try to see \'Plan 9 From Outer Space\'; however, Kramer \'tries\' to sneak in a gourmet coffee, spills it and his lawyer says he has a case.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Maestro', 7, 3, 'Yes', 'Yes', 'Yes', 5, 10, 1995, 'George is feeling the pressures of his relationship with Susan and decides that he needs to help a security guard that works at her uncle\'s store. Kramer\'s friend \'Maestro,\' makes a comment about getting a rental property in Tuscany that makes Jerry decide to do some research. Elaine begins dating the \'Maestro.\' Kramer\'s out of court settlement in his lawsuit against the coffee house, free coffee at any location around the world, gets him \'hopped up on the caffeine.\' Jerry asks Poppy about Tuscany and is referred to Poppy\'s cousin, who makes him an offer he can\'t refuse.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Wink', 7, 4, 'Yes', 'Yes', 'Yes', 12, 10, 1995, 'Elaine gets a blind date with the guy from her wake-up service; however, he likes dogs. A bit of grapefruit pulp, from Jerry\'s healthy breakfast, gets into George\'s eye and causes problems for him when his winks keep getting misinterpreted. Jerry\'s healthy diet conflicts with his dating of Elaine\'s cousin. Kramer promises a sick boy that Yankee Paul O\'Neill will hit two home runs for him, so he can get back a birthday card that he sold based on George\'s wink.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Hot Tub', 7, 5, 'Yes', 'Yes', 'Yes', 19, 10, 1995, 'George picks up a bad habit from some visiting baseball officials. During the time of the New York City Marathon, Elaine has an out of country runner as her house guest. The runner had overslept and missed the big race at the last Olympics and Jerry obsesses with ensuring that it doesn\'t happen again. Kramer gets a hot tub from his friend Lomez and Elaine has writer\'s block.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Soup Nazi', 7, 6, 'Yes', 'Yes', 'Yes', 2, 11, 1995, 'While on their way to the \'soup place\' Elaine finds an antique armoire she wants. George makes a mistake while trying to get his soup from the \'Soup Nazi.\' Elaine isn\'t allowed to move her armoire into her building, so Kramer offers to watch it for her, out on the street. George and Elaine discuss how annoyed they are by Jerry\'s sweet-talking with his current girlfriend, especially their calling each other \'Schmoopie.\' Elaine makes an ordering error in front of the \'Soup Nazi,\' gets on his bad side and is banned for a year. In broad daylight and in Kramer\'s presence, two \'tough\' guys come along and take Elaine\'s armoire. Kramer relates the story of the armoire to the \'Soup Nazi,\' who says he has an armoire in the basement that Kramer can have. Jerry\'s girlfriend makes a faux pas in the \'soup place\' and Jerry disavows any knowledge of her. George confronts Jerry and reminds him about their pact. George and Susan see Jerry and his girlfriend at the diner and they begin to compete against each other. Susan appreciates that George is finally showing his feelings in public. Kramer gives Elaine the armoire and tells her where he got it. Elaine goes to thank the \'Soup Nazi\' but gets even further on his bad side. Jerry discovers the armoire contains the \'Soup Nazi\'\'s recipes and Elaine takes them for her final confrontation with the \'Soup Nazi.\'', 'Y', 'N', 9.6),
	('Seinfeld', 'The Secret Code', 7, 7, 'Yes', 'Yes', 'Yes', 9, 11, 1995, 'George tries to keep his ATM code a secret from Susan. Elaine is puzzled by a man she once met at a party and talked to for ten minutes, doesn\'t remember her, but he does remember other party details. Leapin\' Larry, a one-legged man, wants Jerry to do spots for his store, but he is angered when he thinks Jerry is doing an impression of him. Kramer gets an emergency band scanner and decides to help reorganize operations at the NYFD. Elaine doesn\'t want to go on a date with her boss, the storyteller, so she leaves Jerry and George at the restaurant. Jerry escapes, but George isn\'t as lucky. He is forced to accompany Peterman to his Momma\'s house, where he winds up staying all night and tells her his secret code before she dies. That is her last word. George\'s code is needed in a life or death situation.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Pool Guy', 7, 8, 'Yes', 'Yes', 'Yes', 16, 11, 1995, 'Elaine has tickets for a historical clothing exhibit and realizes that she has no female friends; Jerry suggests that she ask Susan. Kramer suggests that is the wrong move and that George\'s worlds will collide. Jerry meets his pool guy outside a movie, and then he can\'t get rid of him. George is worried by Elaine wanting to get to know Susan, then he finds out it was Jerry\'s idea. Kramer\'s new phone number is similar to a film information line. When Kramer keeps getting wrong numbers, he begins giving out the information for movie show times a la \'Moviefone.\'', 'Y', 'N', 8.5),
	('Seinfeld', 'The Sponge', 7, 9, 'Yes', 'Yes', 'Yes', 7, 12, 1995, 'Jerry finds the number of girl he wants to contact on Kramer\'s AIDS walk sponsor list. After finding out that her preferred method of birth control is only available in a limited supply, Elaine must decide whether her current boyfriend is \'sponge worthy.\' George tells Susan the secret of the size of Jerry\'s jeans and that leads to a fight about all secrets, he tells her another of Jerry\'s secrets when they make up. Jerry finds out that George told Susan one of his secrets and now he\'s \'out of the loop.\' Elaine adjusts her screening process to find worthy candidates. Kramer causes a disturbance at the AIDS walk when he won\'t \'wear the ribbon.\'', 'Y', 'N', 8.6),
	('Seinfeld', 'The Gum', 7, 10, 'Yes', 'Yes', 'Yes', 14, 12, 1995, 'Kramer is active in the re-opening of an old movie theater. He also is keeping an eye on a friend, Lloyd, who\'s recovering from a nervous breakdown. Lloyd has a pack of Chinese gum that Kramer insists everyone tries. George thinks the cashier short-changed him and meets a former neighbor (who\'s had a breakdown) and his daughter, Deena. George lets his former neighbor look at his car. Elaine tries to avoid interacting with Lloyd, loses a button from her blouse and reveals herself to Lloyd and Kramer. Because of Elaine\'s lie, Jerry must wear glasses while around Lloyd. Deena tells George that she thinks he is showing signs of being on the verge of a breakdown. George\'s car, once owned by \'Jon Voight\', catches fire. Elaine shows more to Lloyd. Jerry gets more gum. George keeps trying to convince Deena he\'s not crazy.', 'Y', 'N', 9),
	('Seinfeld', 'The Rye', 7, 11, 'Yes', 'Yes', 'Yes', 4, 1, 1996, 'Elaine is dating a jazz saxophonist who\'s sponge-worthy but \'he doesn\'t really like to do everything.\' Jerry tells one of the members of his band that the saxophonist and Elaine are \'hot and heavy.\' Kramer stocks up on supplies, including 50 cans of \'Beef-A-Reeno\'. Susan\'s parents meet and have dinner with the Costanza\'s for the first time. Both families obsess over a loaf of rye bread that wasn\'t served with the meal, which Frank takes back home. Elaine\'s boyfriend writes a song about \'their relationship,\' which later has a big impact on his career. Kramer takes over a friend\'s horse-drawn carriage for a week and helps George out with his scheme to replace the rye bread. Unfortunately, he feeds the horse a can of \'Beef-A-Reeno\' right before giving the Ross\'s their ride. Jerry manages to get his hands on a loaf of marble rye.', 'Y', 'N', 9),
	('Seinfeld', 'The Caddy', 7, 12, 'Yes', 'Yes', 'Yes', 25, 1, 1996, 'Kramer befriends a caddy, who helps him to improve his golf game and offer his other advice. George\'s bosses consider him for a promotion when they think he is so dedicated to his work that he is there in the morning before everyone else and still there after they all leave. They don\'t know that he\'s just been leaving his car in the parking lot waiting for his free visit from a locksmith. Taking advantage of the situation, he and Susan go up north to her parent\'s rebuilt cabin. Elaine meets an old rival who\'s heir to the Oh Henry! candy bar fortune and has never worn a bra. She wears the bra as a top and cause Kramer and Jerry to have an accident with George\'s car. With George\'s damaged car in the parking lot, the Yankees think he\'s dead. Steinbrenner breaks the news to the Costanza\'s. Kramer and Elaine take her rival to court and only Jerry may stand in the way.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Seven', 7, 13, 'Yes', 'Yes', 'Yes', 1, 2, 1996, 'Elaine sees a girl\'s bike she wants, but she strains her neck trying to getting the bike down from the wall. In pain she promises the bike to whoever fixes her neck. Kramer saves the day and wants the bike. George is angry when Susan\'s cousin chooses to name her baby with the name he planned to give his first offspring. He desperately tries to convince them to use another name. Kramer works out an arrangement with Jerry to keep track of what he takes from Jerry\'s kitchen. Jerry is curious when his girlfriend is always wearing the same dress, every time they go out.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Cadillac - 1', 7, 14, 'Yes', 'Yes', 'Yes', 8, 2, 1996, 'Jerry surprises his parents by buying them a new Cadillac, when his last job really pays well. Kramer, who now knows how much Jerry makes, says it will change their relationship. It certainly changes his relationship with Elaine, she\'s interested again. George reconsiders his engagement when one of Elaine\'s friends tells him that she could have set him up with Oscar winning actress, Marisa Tomei. The cable company wants to see Kramer and he takes the opportunity to get revenge on them. George wants to meet Marisa for a cup of coffee, even when Elaine\'s friend is in the hospital with a heart condition. Jack Klompus accuses Morty of embezzling funds to pay for his new Cadillac.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Cadillac - 2', 7, 15, 'Yes', 'Yes', 'Yes', 8, 2, 1996, 'Kramer continues to play with the cable guy. George\'s obsession with Marisa makes Susan suspicious. Elaine calls Jerry in Florida and tells him she wants to come and join him. Elaine gets George Marisa\'s phone number and now he needs her for an alibi (which involves her \'boyfriend\' Art Vandelay, an importer/ exporter). Morty\'s ace in the hole, to keep him from impeachment, is the woman that Jerry stole the marble rye from, only she doesn\'t remember him, at least at first. The cable guy zeros in on Kramer, but he gets away. George\'s meeting with Marisa doesn\'t go as well as planned and Susan thinks he\'s having an affair with Elaine. The cable guy concedes defeat.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Shower Head', 7, 16, 'Yes', 'Yes', 'Yes', 15, 2, 1996, 'Elaine gets a physical for a pending trip with Peterman to Africa. Her physical test results show positive for opium, so Peterman fires her. Jerry\'s parent are in seclusion in New York while biding time until they can move back to Florida. George tries to convince his parents to move to Florida. The shower heads in Jerry\'s building are being replaced with a new low-flow model; Newman finds a source for black market shower heads. The Seinfelds tell the Costanzas that there is no room for them in Florida that gives Frank all the incentive he needs to move. George is delighted. Elaine finds the cause of her opium addiction and finds a donor for her next physical. Jerry makes a joke on The Tonight Show with Jay Leno at the expense of Uncle Leo and he pays the price for making fun of the family.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Doll', 7, 17, 'Yes', 'Yes', 'Yes', 22, 2, 1996, 'Susan\'s old roommate from college, Sally Weaver, gives Jerry a package that she wants him to be careful with; which he is, but he loses his own package in the process. Frank tells George he is turning his room into a billiard room. Elaine tells Frank about a man she saw in Tuscany who looks just like him, Frank thinks it may be the cousin who stayed behind. Kramer challenges him to a game where the space is a bit tight. Jerry is enthusiastic about a new toothbrush, which he is convinced Elaine must have. Susan has a doll that looks uncannily like George\'s mother; she doesn\'t believe it, but he does and it affects his performance. Jerry is going to be on Charles Grodin\'s show with one of the Three Tenors, not Pavarotti or Domingo, but \'the other guy.\' Elaine goes with him the studio, to replace an autographed picture of \'the other guy,\' for \'the Maestro\' that was damaged while they were in Tuscany. \'The Maestro\' provides a new fashion for Kramer and Frank while playing pool, and his baton is an answer to the space problem in the billiard room. Susan\'s roommate comes to town. She tries to help Jerry out by bringing him back a better barbecue sauce and bringing a doll to the studio for Jerry, which in her opinion, is much funnier than the one Jerry wanted. Jerry has no material for his appearance.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Friar\'s Club', 7, 18, 'Yes', 'Yes', 'Yes', 7, 3, 1996, 'George is happy because he has a three-month reprieve. The wedding is delayed until June (just in time for the end of the May sweeps and a cliffhanger!). Meanwhile he is also excited because Jerry is going to go out with Susan\'s best friend. He envisions their friendship in the future as being \'Gatsby\'-like. Jerry is trying to get into the Friars Club, but loses a jacket he \'borrowed\' for dinner there, at a performance of comedic jugglers that was \'worked on\' by Susan\'s friend. Kramer tries to duplicate the sleeping patterns of Da Vinci and falls asleep at some inopportune moments; one of which puts him put in the Hudson River. Peterman hires a deaf employee and Elaine suffers the consequences, when she gets loaded with some of his work. Trying to see how deaf he really is, Elaine comes on to him, which Peterman overhears and tries to help out their budding relationship.', 'Y', 'N', 8.1),
	('Seinfeld', 'The Wig Master', 7, 19, 'Yes', 'Yes', 'Yes', 4, 4, 1996, 'Jerry uses Elaine to prove that a sales clerk is wrong about his looking at an expensive jacket. Elaine is picked up by the clerk. George has an unwanted house guest, a wig master for the touring company of \'Joseph and the Amazing Technicolor Dreamcoat.\' He also has found a parking lot that charges $75 dollars a month; Kramer decides to put his car there. Unfortunately, he leaves his apartment key there. When he can\'t get his key, he is allowed to borrow a pink Cadillac. Jerry is convinced the clerk is working Elaine. George discovers why the lot is so cheap, he finds a used condom in his car and is asking a prostitute for information, just as Susan approaches. George discovers that he may have an out with Susan; she says she must be able to trust him and have no doubts. Kramer stays at Jerry\'s apartment. Elaine has a walking stick she lets Kramer have. Jerry tries to return his jacket, but discovers that \'spite\' isn\'t a viable reason. Kramer is allowed to borrow the back up \'Electric Color Dreamcoat.\' Jerry is put out, when both sexes assume he isn\'t in a relationship with the person he is with (Elaine in one instance, the Wig Master in the other). Kramer finds a fuzzy white hat. With all the parts put together, his new ensemble is a sight to behold, just ask the NYPD after he is caught pulling a prostitute out of his borrowed car.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Calzone', 7, 20, 'Yes', 'Yes', 'Yes', 25, 4, 1996, 'George becomes Steinbrenner\'s pet, when he shares an eggplant calzone with him. Kramer is raving about wearing clothes \'straight out of the dryer.\' Jerry thinks that Elaine\'s boyfriend is dating her without really ever asking her out. He offers to bring Jerry some Cuban cigars from Canada. Jerry takes advantage of his girlfriend\'s ability to get anything she wants. Kramer searches for quarters for the dryer; when he can\'t find anymore, he starts using an oven. George gets into tip trouble with the counter guy at the calzone shop and he works out an arrangement with Newman. That is unless of course it\'s raining (Newman doesn\'t deliver mail in the rain); Kramer helps out.', 'Y', 'N', 9),
	('Seinfeld', 'The Bottle Deposit - 1', 7, 21, 'Yes', 'Yes', 'Yes', 2, 5, 1996, 'George doesn\'t hear the details on an important project that Wilhelm wants him to champion. Peterman wants Elaine to bid on a set of golf clubs at the Kennedy auction, her ceiling is $10,000; however, she gets into a bidding war with Sue Ellen, the Oh Henry! candy heiress. Consequently, she spends a bit more than she was authorized. Newman finds the missing ingredient to make it cost effective in Kramer\'s scheme to collect used pop bottles and cans and take them to Michigan where the refund is doubled. Jerry takes his car to a mechanic, who\'s fanatical about car care. Elaine meets Jerry to get the golf clubs out of his car, but the mechanic, distraught over Jerry\'s negligence, steals it. Kramer and Newman collect their bottles and cans and hit the road in a mail truck.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Bottle Deposit - 2', 7, 22, 'Yes', 'Yes', 'Yes', 2, 5, 1996, 'Wilhelm is delighted with the job George did on the project; however, he has no idea what he did or how he did it. The detective on the case thinks he\'s found Jerry\'s car, damaged beyond recognition. It\'s not, and later Jerry\'s mechanic calls him from the car. Kramer spots Jerry\'s car in Ohio. Steinbrenner calls George into his office about the project report and has him committed. Kramer ditches the cans, bottles, mailbags and Newman in pursuit of Jerry\'s car. Newman finds a farmer\'s house, complete with the proverbial daughter. The mechanic throws the clubs and bag at Kramer\'s truck, allowing him to get away. Deena is happy to see that George is getting the help he needs. Peterman is stunned when he finally gets the clubs, \'Elaine, I never knew Kennedy had such a temper.\'', 'Y', 'N', 8.9),
	('Seinfeld', 'The Wait Out', 7, 23, 'Yes', 'Yes', 'Yes', 9, 5, 1996, 'After George makes an off-hand remark to a married couple with a rocky relationship, Jerry and Elaine wait in anticipation of their inevitable separation. Elaine sports a new hairstyle, starts driving again and almost makes Jerry car sick. Kramer starts wearing jeans again. The jeans are much too tight, so tight in fact, that he can\'t get them off when he really needs to. Elaine and Jerry make plans to move in on the separated couple, which they do. George feels guilty about breaking up the marriage and wishes to undo the damage. Jerry and Elaine physically oppose this action. David returns the off-hand remark to George in the presence of Susan. She tells George she has to think about some things- he thinks it is his ticket out.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Invitations', 7, 24, 'Yes', 'Yes', 'Yes', 16, 5, 1996, 'As the big day grows nearer, George and Susan order their invitations. Susan lets him choose the cheap ones. George tries to think of a way out. Elaine suggests smoking and Kramer suggests a pre-nuptial agreement. Jerry, thinking of a single future with Kramer, nearly gets hit by a car but is saved by his female equivalent, Jeannie. Jerry thinks he is in love with Jeannie. Kramer tries to cash in on a bank\'s offer of a $100 if one of their tellers doesn\'t say hello. Is \'Hey,\' hello? George tries the suggestions and strikes out. Susan begins preparing the invitations. Jerry makes a decision. Susan passes out while licking envelopes. Jerry proposes marriage; later he has second thoughts. George finds Susan and the gang meets him over at the hospital, where George gets the news, he\'s out. Free at last, George makes another attempt at Marisa Tomei.', 'Y', 'N', 9),
	('Seinfeld', 'The Foundation', 8, 1, 'Yes', 'Yes', 'Yes', 19, 9, 1996, 'Months after her death, George is ready to move on, but Susan\'s parents want to keep her memory alive. Kramer becomes a karate master, where his opponents are equals in his skill level, but are lacking in size. Jerry runs into Dolores, you remember \'her name rhymed with a female body part\' in \'The Junior Mint,\' she suggests that they get together again. Peterman has a breakdown and goes to Burma leaving Elaine in charge; a position she is reluctant to assume. Kramer makes a speech that inspires Elaine to go and take charge of J. Peterman. Inspired by a comment that Jerry made, a foundation is established in Susan\'s name, which will take up all of George\'s free time. Jerry and Dolores do get together; however, when she hears why Jerry\'s engagement was broken off, she leaves commenting that he still hasn\'t matured. Elaine sees Kramer\'s opponents, vents her frustration and takes him down in front of the class. Jerry decides to research breakups and the effect on future relationships. Kramer\'s classmates meet him after class. George discovers everything he lost when he lost Susan.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Soul Mate', 8, 2, 'Yes', 'Yes', 'Yes', 26, 9, 1996, 'George thinks the foundation lawyer thinks he might have killed Susan, Jerry suggests using a method employed by Jerry Lewis to find out. Kramer falls for Jerry\'s girlfriend and he consults Newman for advice. Elaine\'s friends insist that she have a baby, she\'d rather not and meets a man who shares her ideals. George leaves a running tape recorder in his brief case at the next board meeting and leaves the room. He returns to find the briefcase damaged and the tape stopped. Newman gets in the middle of Jerry and Kramer\'s relationship with Pam; he bribes Jerry in hopes to find out more about his obsession, Elaine. Meanwhile, her new boyfriend gets a vasectomy to show her how committed he is to not having children. The guys find out Pam isn\'t interested in having children and they line up for their own vasectomies. George gets to the bottom of what happened to his briefcase.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Bizarro Jerry', 8, 3, 'Yes', 'Yes', 'Yes', 3, 10, 1996, 'Kramer uses a bathroom in an office building and just begins working there. He is \'TCB.\' Elaine sets Jerry up with a friend who is very beautiful, but she has \'man hands.\' George uses a picture of her and passes her off as his dead finance Susan; that gets him into the \'Forbidden City\' where high priced models hang out. Elaine meets Kevin and some of his friends; they are the exact opposite of Jerry, George and Kramer. With Kramer working, George inside the walls and Elaine hanging out with Kevin, Jerry begins to feel alone.', 'Y', 'N', 9.2),
	('Seinfeld', 'The Little Kicks', 8, 4, 'Yes', 'Yes', 'Yes', 10, 10, 1996, 'Elaine reluctantly lets George attend a party she is throwing at work. \'Sweet fancy Moses\' exclaims George when he sees Elaine dance at a party she\'s holding for her employees. She wonders why they\'ve lost respect for her. Jerry gets 2 tickets to a premiere of a film. Kramer asks him to get an extra ticket for his friend Brody. Elaine thinks the loss of respect might be due to George\'s influence, so she makes him off limits to Anna, one of the women George talked to at the party. That \'bad boy\' image makes him all the more desirable. Jerry and Kramer attend the film with Brody, who begins to make a bootleg tape. Brody gets sick and has Kramer take him home, leaving Jerry to finish making the tape. Jerry worries about the implications when Brody likes him camera work and asks him to do another film. However, he complains about the quality of Kramer\'s work. Elaine finds out the truth about her dancing after she tapes herself. Elaine apologizes to Anna and George, which suddenly makes him undesirable. Brody won\'t meet Jerry\'s demands for equipment; George takes on the challenge, but gets arrested. Frank comes to bail him out and Elaine lets him know the truth about his son. Elaine\'s dance becomes a big hit on the streets of New York.', 'Y', 'N', 9.1),
	('Seinfeld', 'The Package', 8, 5, 'Yes', 'Yes', 'Yes', 17, 10, 1996, 'Elaine has a rash and looks for a doctor who will treat her. despite her doctor -- patient relationship reputation. Kramer offers Jerry a method to get a refund on his stereo that is two years out of warranty. George discovers the woman at the now all they must do is collect the insurance money from the post office. Elaine poses as Uncle Leo\'s nurse to try a diagnosis for her condition. When that doesn\'t work she tries to get Kramer to lift her records. Newman grills Jerry on suspicion of mail fraud. George drops off his film at the photo store and gets a surprising result. photo store is looking at his pictures. Jerry refuses delivery of a package with no return address. George thinks that the photo store clerk has stuck a revealing picture of herself in with his pictures. Kramer convinces George to return the compliment and offers to take the photos. Uncle Leo signs for Jerry\'s package. Elaine tries to lift her medical records. Jerry lets Uncle Leo open the package and there is the sound of an explosion. Leo\'s stove has exploded but eventually Jerry gets the package and opens it up. It contains his stereo in pieces. Kramer sent the package to him insured', 'Y', 'N', 8.8),
	('Seinfeld', 'The Fatigues', 8, 6, 'Yes', 'Yes', 'Yes', 31, 10, 1996, 'Jerry is intrigued by the concept of his girlfriend having a mentor. George prepares to give a lecture on risk management by reading a book, but realizes that books on tape have spoiled him. Elaine prepares to fire an employee, but when face to face with him, she promotes him. Kramer runs a Jewish singles night at Frank\'s Knights of Columbus hall. Jerry meets his girlfriend\'s mentor, but she is dating Kenny Bania. George discovers the blind can get any book on tape, so he plans to fail an eye test. Elaine\'s recently promoted employee has some startling new ideas. She plans to promote him again. Kramer\'s party plans go awry when he has to cook for over 150 plus people. He needs to get Frank\'s advice on cooking for the masses, despite George\'s warning. Elaine\'s promotional plan backfires, when the rest of her staff quits. Jerry\'s girlfriend sees Bania\'s act and loses respect for her mentor. Elaine tries working with her employee. George figures out an angle to get his book read. Jerry finds himself becoming Bania\'s mentor. Jerry and his now ex-girlfriend get their files mixed up; George speaks on Ovaltine and Bania on risk management. Frank\'s cooking skills are reborn, until he sees someone choking.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Checks', 8, 7, 'Yes', 'Yes', 'Yes', 7, 11, 1996, 'Elaine\'s new boyfriend, Brett, is obsessed with designer furniture and the song \'Desperado.\' Jerry spots an umbrella salesman using the sales technique he invented. The salesman says it was someone else. Hundreds of twelve-cent royalty checks keep arriving from Jerry\'s brief appearance on a Japanese television. Kramer warns George that the carpet cleaners he hired are actually a front for a religious cult. Intrigued, George tries to be converted, but they\'re not interested. Kramer meets some Japanese businessman and he takes them on the town and to the cleaners. He is a little confused about the exchange rate. Brett delivers a large chest of drawers to Kramer and thinks that Jerry might be jealous. Kramer thinks the TV pilot that Jerry and George did would be perfect for Japanese television. They pitch it to a couple of Japanese TV executives. Elaine tries to find a song that she and Brett can share. Kramer puts his Japanese friends up at his place. They\'re sleeping in the chest of drawers. Jerry caught in the rain meets the man in the street that claims credit for the twirl. He also meets Brett who is convinced Jerry is down on his luck. George gets the cleaners to do the offices at Yankee Stadium where they find a new recruit. Because of the humidity from the hot tub, Kramer\'s guests get stuck in the chest. Jerry, with writer\'s cramp from check signing, uses a fire ax to open the chest. That scares the Japanese guests and injures Brett who passes out.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Chicken Roaster', 8, 8, 'Yes', 'Yes', 'Yes', 14, 11, 1996, 'George reveals a strategy to guarantee a second date with women - leaving an object behind at their place. However, this strategy gets Elaine into trouble, when George leaves behind a sable hat she shouldn\'t have charged to the Peterman expense account. Meanwhile, the red neon sign of a new Kenny Rogers Roasters restaurant beams directly into Kramer\'s apartment. Jerry and Kramer then switch apartments, and end up switching personalities as well.', 'Y', 'N', 9.1),
	('Seinfeld', 'The Abstinence', 8, 9, 'Yes', 'Yes', 'Yes', 21, 11, 1996, 'George\'s girlfriend has mononucleosis and he can\'t have sex with her for six weeks. Elaine\'s met a doctor who\'s almost gotten his license to practice. Jerry agrees to appear at career day at his former junior high school, first he is bumped and then there is a fire drill. Kramer lights up a cigar in Monk\'s and is asked to leave. He meets others on the street who face his dilemma so he opens up his apartment as a smoking lounge. Jerry\'s agent gets him an assembly at the school. George\'s lack of sex makes his mind sharper. Elaine learns how much her doctor boyfriend doesn\'t know about medicine. She uses George\'s technique to help him study to get his license, but in the process she becomes an idiot. Jerry struggles to figure out how to fill two hours in front of a junior high crowd. George uses his new found intellect to give batting advice, speaks Portuguese and prepares a presentation for Jerry\'s assembly. Kramer sees his lawyer about a case against the tobacco company, smoking has destroyed his looks. He gets a settlement without Jackie\'s input. George calculates the odds of scoring with a Portuguese waitress. Elaine\'s boyfriend gets his license and leaves her sexless.', 'Y', 'N', 9.1),
	('Seinfeld', 'The Andrea Doria', 8, 10, 'Yes', 'Yes', 'Yes', 19, 12, 1996, 'George is excited about the new apartment he is going to move into. Elaine is on a blind date, now called a \'set-up.\' Jerry takes Kramer to his self-storage where they discover that Newman has been hiding bags of mail. George finds out he can\'t get his apartment because the tenant association is going to give it to an Andrea Doria survivor. Elaine is told her date won\'t be making it because he\'s been stabbed. She is aroused by the situation. Kramer\'s cold is getting bad and he\'s not going to the doctor, they botched his vasectomy, he\'s more potent now than ever. Jerry tries to get Newman to get rid of the mail; however, he\'s not interested because he didn\'t get the transfer to Hawaii. Kramer finds a dog with a cold that he volunteers to take to the vet, so he can get medicine for their colds. Elaine meets her blind date who gets coffee thrown in his face from another ex-girlfriend. She discovers his problem is that he is a \'bad breaker upper.\' George confronts his rival for the apartment and decides to wage war. Elaine\'s blind date breaks up with her and tells she has \'a big head.\' From a suggestion by Jerry, George asks for a hearing with the association and tells them the story of his life. Jerry forms \'an alliance\' with Newman that will hopefully get him out of his life forever. Jerry tries to get Kramer to take his medication. He discovers that Kramer is taking dog medication and beginning to exhibit the signs of being a dog. The big head comment begins to hold true for Elaine and she makes a comment about jamming \'a fork in his forehead.\' Jerry tries to take Kramer to a real doctor. After Kramer bites Newman\'s ankle, Jerry offers to deliver the rest of his mail. He is too efficient for the post office. Elaine meets up with her blind date and makes good on her promise. Kramer saves the day. George and the survivor don\'t get the apartment.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Little Jerry', 8, 11, 'Yes', 'Yes', 'Yes', 9, 1, 1997, 'Everyone makes a comment about a bad check of Jerry\'s that is on display at Marcelino\'s store. Through the Foundation, George gets the opportunity to visit a women\'s prison. He is disappointed when the facility doesn\'t meet his impression of what he thinks a women\'s prison is. He does however meet a convict that he decides to ask out. He enjoys the liberation that dating a convict offers. Kramer gets a new pet, a rooster that he names \'Little Jerry Seinfeld\'; of course he really wanted a hen for the eggs. Jerry\'s parents find out about the check and offer to send money. Elaine finds out her bald boyfriend once had a fine head of hair. She convinces him to start growing it back, but when he does he shows signs of hair-loss. He begins to feel despondent. George\'s dream relationship hangs on the brink, Celia\'s up for parole. Kramer enters \'Little Jerry\' in a cockfight that if he wins, Jerry\'s bad check will be taken down. George is a character witness for Celia\'s parole hearing; he testifies to try keeping her in. Jerry\'s bad check doesn\'t come down, because Marcelino wants Jerry to do something for him first. Kurt seeks hair-loss advice from George that causes him to propose to Elaine. Jerry and Kramer train \'Little Jerry\' for the big cockfight. George experiences \'fugitive sex\' when Celia breaks out after her parole was denied. Celia is tracked down and Kurt is mistaken for George. Marcelino brings a ringer in for the big fight; Kramer tries to save \'Little Jerry\' but pays the price.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Money', 8, 12, 'Yes', 'Yes', 'Yes', 16, 1, 1997, 'Jerry\'s parents sell the Cadillac to Jack Klompus for $6000 in order to give Jerry some money to help him out. They along with Kramer suggest that Jerry might try a career move. Elaine talks about her Peterman stock options and buys George\'s coffee. He thinks she is sticking it to him. Jerry and George talk about the money their parents might have. This piques George\'s interest. Kramer seeks advice from Elaine about his girlfriend\'s post-sex bed habit \'she\'s got the jimmy legs.\' Jerry flies to Florida to buy the Cadillac back. George seeks information on his family\'s health history. Kramer works out a deal with his girlfriend. Jerry meets with Klompus and agrees to pay $14,000 for it. George anticipating a big inheritance begins to spend money. Unfortunately for him, so do his parents. Klompus has a problem with the car and Jerry returns to Florida. Jerry\'s parents are still worried about him and wonder what to do. Morty decides to see Elaine about a job; she reluctantly agrees to give him a job, just as Peterman returns. Kramer, fearing a prowler (Jerry\'s dad), decides he can no longer sleep alone; unfortunately his girlfriend has decided she can. So he moves in with the Costanzas, who tell George that they are moving to Florida. Elaine returns to her regular position at Peterman, with no options. George and Elaine try to discuss their respective problems. Still in Florida, strapped for cash and credit, Jerry sleeps in the Cadillac. Kramer and Emily spend the night as an old married couple in the Costanzas\' house. The Seinfelds make a change in their housing as the Costanzas try to settle into their new place.', 'Y', 'N', 8.1),
	('Seinfeld', 'The Comeback', 8, 13, 'Yes', 'Yes', 'Yes', 30, 1, 1997, 'George has trouble thinking of a comeback to a comment made by Reilly; he does think of one, but it\'s a little to late. Jerry buys a new tennis racket from a supposed professional. Elaine and Kramer discuss video picks. Elaine prefers picks by Vincent. He prefers picks by Gene or his own. He watches his latest pick and it makes him concerned about spending the rest of his life in a coma. Elaine is intrigued when she receives a phone call from the mysterious Vincent. Jerry discovers that the tennis pro is a hack player. George comes up with what he thinks is the perfect line and will listen to no one else\'s opinion. Kramer makes a living will, with Elaine as the executor. The tennis pro, fearing he will be exposed, tries to bribe Jerry, including a rendezvous with his wife. Elaine opts for another movie and makes Vincent angry. George finds out that Reilly doesn\'t work for the Yankees anymore, so he tracks him down to Ohio, where he plans to deliver his line. Kramer finishes the movie he rented and discovers it is possible to recover from a coma, he decides to change his will. Milos\' wife has no respect for him; he asks Jerry to let him beat him in tennis. Elaine receives a phone call from Vincent and she convinces him to let her meet him. She is surprised by his appearance. Kramer goes into a coma after being hit with tennis balls. Meanwhile, in Akron, George delivers his line about \'the jerk store.\'', 'Y', 'N', 8.9),
	('Seinfeld', 'The Van Buren Boys', 8, 14, 'Yes', 'Yes', 'Yes', 6, 2, 1997, 'Jerry\'s girlfriend, Ellen, seems perfect in every way, but everyone else seems to have a problem with her. George interviews candidates for the Foundation\'s first scholarship. The candidates seem over-qualified, until one comes in who is a lot like he was. Elaine is going to ghost write Peterman\'s biography. Kramer goes to Lorenzo\'s pizza, where he has an encounter with the Van Buren boys. He accidentally flashes their gang sign and saves himself. Peterman wants his day to day life covered in his bio; the exotic adventures are for the catalog. His day-to-day life is very boring. She tells him about Kramer\'s encounter with the gang and he suggests buying the story for his biography. George\'s scholar makes a change in his plans that causes George to disqualify him from the scholarship. Kramer sells Peterman all of his stories for $750 dollars. Elaine is put at his disposal. To Elaine, Kramer\'s stories aren\'t much more interesting. George and Kramer perform an intervention on Jerry\'s relationship with Ellen. George\'s scholar joins the Van Buren boys, who apply pressure on George to get the scholarship back. Elaine tells Kramer that he can no longer tell his stories, since they now belong to Peterman. Elaine tries to embellish Kramer\'s stories, but Peterman finds the rewrites \'\'too cliched and obvious.\'\' She tells him the real Kramer story that he finds much more interesting. He tells Kramer he can have his stories back. George tries to save himself from the Van Buren boys. Jerry flies his parents in to get their impression of Ellen. He begins to see the light.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Susie', 8, 15, 'Yes', 'Yes', 'Yes', 13, 2, 1997, 'Kramer decides that daylight saving time isn\'t coming fast enough, so he sets his watch ahead an hour. Mike, the guy who once referred to Jerry as \'a phony,\' has become a bookie. Peggy, a co-worker of Elaine\'s calls her \'Susie.\' George is excited about Steinbrenner\'s ball. He hopes to show off his tall blonde girlfriend with a grand entrance. Instead, she says she wants to talk. He runs away. \'If she can\'t find me, she can\'t break up with me.\' He really wants to make that big entrance at the ball. Kramer tells Jerry that he owes Mike $100 for a bet he made on that night\'s Knicks game. Only Jerry never made the bet; Kramer did it for him. In fact, Kramer attends the game and gets into a fight with a key player that causes Jerry to win his bet. Peggy starts talking to \'Susie\' about Elaine\'s memo. Peterman hearing about the complaints demands to see Elaine, Peggy and \'Susie\' in his office; first thing in the morning. Mike can\'t pay Jerry, so he offers to help him with his trunk problem, but instead gets his thumbs broken for the trouble. Kramer breaks up with George on behalf of Allison. Elaine makes it through the morning meeting. Mike gets trapped in Jerry\'s trunk. Elaine and Jerry, in his car, decide it would be best to eliminate \'Susie.\' George reconciles with Kramer. Elaine delivers the eulogy at \'Susie\'s\' wake, much to the confusion of Peggy. Kramer, with George, makes a spectacular entrance at the ball. Mike escapes from Jerry\'s trunk and accuses him of murder. The same fate befalls Elaine that befell George; Peterman puts her in charge of a foundation in \'Susie\'s\' honor.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Pothole', 8, 16, 'Yes', 'Yes', 'Yes', 20, 2, 1997, 'Elaine wants to have some Chinese food delivered, but lives just outside the delivery zone. In order to fool the delivery man, she pretends that the janitor closet in the building across the street is her apartment. The trouble is the landlady mistakes her for the janitor. Kramer joins the \'adopt a highway\' program, but his methods are a little unorthodox. Jerry\'s new girlfriend uses a toothbrush that had fallen into the toilet, which causes him more trouble than he could have imagined. George loses his keys, and by the time he finds them, they\'re buried at the bottom of recently filled pothole.', 'Y', 'N', 8.8),
	('Seinfeld', 'The English Patient', 8, 17, 'Yes', 'Yes', 'Yes', 13, 3, 1997, 'A woman mistakes George for her boyfriend Neil, a guy who looks just like him. This intrigues George; he wants to meet Neil. Jerry is going to Florida to help his parents move. Kramer asks him to pick up some Cubans from his cigar guy and also gives him a T-shirt. Elaine and her boyfriend see \'The English Patient\'; she absolutely hates it and that makes her unpopular and dumped. Jerry\'s dad gets the T-shirt, #1 Dad, that he is very proud to wear, despite its small size. At his parents\' exercise room, Jerry meets Izzy, an 80-year-old man who can\'t stand to lose; he challenges Jerry to a weightlifting competition; \'It\'s go time!\' He throws his back out again and again. Kramer\'s Cubans arrive; they\'re real people and not the cigars that Jerry thought he would be getting. George is overly obsessed with Neil, to the point where he is missing out on Danielle. Jerry is back in New York, where Izzy has returned to see a back specialist. Though Kramer\'s Cubans are really Dominicans he tries to pass them off as \'Cubans\' anyway; it doesn\'t work. Elaine\'s dislike for the film alienates her from everyone. When she tells Peterman that she hasn\'t seen the film, he immediately takes steps to correct the situation. Jerry meets the rest of Izzy\'s family all of who are fiercely competitive. He finds work for Kramer\'s \'Cubans.\' Elaine still hates the movie, but must go to the Tunisian desert to live in a cave to save her job. Kramer thinks his unemployed Dominicans, whom he educated about communism, are planning to revolt; later they do. George gets a last word on Neil when Danielle makes a decision between the two of them.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Nap', 8, 18, 'Yes', 'Yes', 'Yes', 10, 4, 1997, 'George is tired and needs to take a nap while at work; he finds the perfect place, under his desk. Kramer has taken up swimming, but he finds the pool too constricting for his needs; he begins swimming in the East River. Elaine\'s date is worried about his back and hers; he sends her a mattress and she gets the wrong idea. She gives the mattress to Kramer. Jerry is getting new kitchen cabinets, but the contractor is constantly asking him questions. George gets Jerry\'s contractor to make some modifications for his desk, including space for an alarm clock. Steinbrenner is in George\'s office looking for him; he decides to wait for George to return. George gets Jerry to phone in a bomb threat in an effort to get Steinbrenner out of his office. After finding George under the desk, Steinbrenner thinks he has ESP and would be perfect to meet the terrorist\'s demand of a fitted hat day. Meanwhile, Jerry\'s contractor, left on his own, has made a change in Jerry\'s kitchen that no one likes. Elaine gets her mattress back when she gets the right idea; however, Kramer has fouled it up with the stench of the East River. Elaine\'s boyfriend discovers the benefits of swimming in the East River. Steinbrenner hears a ticking sound in George\'s office, thinks it\'s a bomb and calls in the bomb squad. Jerry decides he needs his old kitchen back. Elaine throws her back out trying to get rid of the mattress. Kramer\'s river gets crowded and George finds a new place to nap.', 'Y', 'N', 9),
	('Seinfeld', 'The Yada Yada', 8, 19, 'Yes', 'Yes', 'Yes', 24, 4, 1997, 'George\'s girlfriend is big on using the phrase \'yada yada\'; Jerry says at least she is succinct. Jerry\'s dentist just became Jewish and he is already making jokes that make Jerry uncomfortable. Kramer and Mickey double date but they can\'t decide which of the women is right for them. Elaine is a character reference for a couple who is trying to adopt; a story she tells during the interview destroys all hope of adoption. George drops by Jerry\'s dental appointment. Mickey and Kramer continue to fight over who gets Karen or Julie. George determines that his girlfriend might be leaving out some significant details with her overuse of the phrase \'yada yada.\' He gets her to fill in the details and discovers more than he wants to know. Jerry confesses to a priest about what he thinks about Tim\'s conversion. George drops by Jerry\'s confession. Kramer decides on the right woman and Mickey also decides to make his a commitment. Tim hears about Jerry\'s dental joke. After hearing Jerry\'s complaints about Tim, Kramer accuses Jerry of being an \'anti-dentite.\' Elaine lobbies on behalf of Beth and Arnie and makes a sacrifice to try getting them a child. Meanwhile, Beth comes to Jerry for help when her marriage is falling apart. It does and she accompanies Jerry to Mickey\'s wedding where she reveals an unknown side of her personality.', 'Y', 'N', 9.1),
	('Seinfeld', 'The Millennium', 8, 20, 'Yes', 'Yes', 'Yes', 1, 5, 1997, 'Elaine gets bad service at a clothing store, so she begins shopping at another similar store. Jerry notices that he is on his girlfriend\'s speed dial. Kramer plans for his millennium New Year\'s Eve party two years in advance and he has some strange ideas about what life in that year will be like. George is \'offered\' a position as director of scouting by the Mets. To get the position he must be fired by the Yankees. Elaine flaunts her purchases in front of the store. Jerry obsesses about his position on the speed dial and then he makes it to number 1. Kramer discovers that Newman is planning his own millennium party. George tries to make a big exit from the Yankees organization; however, all his attempts make him look better in the organization. The step-mother of Jerry\'s girlfriend\'s confronts him over his #1 position on the speed dial. Newman compromises with Kramer about their respective parties, they will be combined; however, he only has one condition, the next century must be \'Jerry free.\' Elaine discovers the clothing store she began frequenting is owned by the same woman who didn\'t help her at the other store. Kramer reluctantly agrees but then has misgivings and gets Elaine to come back to his party. Elaine plans her revenge on the store with Kramer\'s help. Jerry gets caught in the middle of a speed dial war between his girlfriend and step-mother.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Muffin Tops', 8, 21, 'Yes', 'Yes', 'Yes', 8, 5, 1997, 'George watches a bag for a tourist who never comes back, so he starts wearing some of the clothes. Elaine tells Kramer that the stories he sold to Peterman were put into the book. Kramer goes to the book signing, claiming he is the real \'Peterman.\' George becomes a tourist from Arkansas when he meets a beautiful woman from the tourist bureau on the street. Jerry shaves his chest and worries about it until he discovers his girlfriend likes hairless dogs. Elaine eats only the tops of muffins and she says that it is a million dollar idea, Mr. Lippman, her former boss, decides to start a business. Kramer starts conducting \'Peterman Reality Tours\' for $37.50 a piece. When the muffin top business doesn\'t seem to be working, Lippman asks Elaine for advice. She tells him that he must make the whole muffin and remove the top from the stump, she also demands that he remove the exclamation point from his sign. The stumps can be given to the homeless. Only they don\'t want them. In fact nobody wants them. Jerry continues to shave his chest despite Kramer\'s warning about hair growth. George \'moves\' to New York and takes a job with the Yankees. Steinbrenner is led to believe that George is holding down two jobs and makes a deal to trade George for chicken. Elaine convinces Kramer to get rid of her stumps and he convinces Jerry and his girlfriend to take his tour. Jerry\'s chest begins itching from hair growth. Elaine hires \'a cleaner\' to make the muffin stump problem go away.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Summer Of George', 8, 22, 'Yes', 'Yes', 'Yes', 15, 5, 1997, 'George discovers he has a severance package from the Yankees that should last him about 3 months and he decides that he is going to take the summer off. Jerry is going to the Tony Awards and so is Kramer; whereas Jerry has a real seat for the awards, Kramer has a job as a seat filler. Elaine critiques a co-worker who walks with no arm movements and is accused of being \'catty.\' Jerry\'s picks up his date, only to find out that she has a man living with her. Kramer gets a Tony Award for a musical in which Raquel Welch is the star. Elaine tries to work things out with her co-worker, to no avail. Kramer uses his Tony as a ticket into a place he really shouldn\'t be, Sardi\'s, where the producers of \'Scarsdale Surprise\' have a proposition for him. Jerry\'s date decides to commit to him. Elaine\'s complaints to men about her co-worker only seem to pique their interest in the possibility of a cat fight. Jerry\'s girlfriend begins to wear him out; she is always on the go. George suggests that perhaps they team up to handle Lanette. To keep his Tony award, Kramer must fire the non-arm swinging Raquel Welch from the production. Jerry goes on a date and needs George to handle the invitations for Lanette\'s party. He is not to skimp, this time. Kramer does his duty and pays a price. A mad Raquel walking down the street gets into a cat fight with a woman who she thinks is making fun of her, Elaine. George gets distracted and slips on an invitation. Twenty-two episodes later the gang is back where they were a year ago, only this time George is the one in a hospital bed.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Butter Shave', 9, 1, 'Yes', 'Yes', 'Yes', 25, 9, 1997, 'Not fully recovered from \'The Summer of George,\' George is using a cane to get around. Jerry might have another shot at NBC, through an appearance on a NBC Showcase that might lead to another pilot. He is also annoyed that lame comic Kenny Bania\'s act is working, only because he is following on Jerry\'s coattails, a time-slot hit. Bania scores with big laughs and also gets one of Jerry\'s ex-girlfriends. George gets a job interview. Elaine is on vacation for a month in Europe with David Puddy. If he\'s lucky he won\'t \'come back in a body bag.\' Kramer finds butter is a better protection for his skin after shaving. George is hired for the job because of his use of the cane. They think he is handicapped and of course he takes full advantage of the situation. Kramer\'s skin feels so good with butter; he takes to spreading it all over his body. Unfortunately he lies out in the sun where he begins to cook. It\'s a long flight back for Elaine and Puddy, who break up and get back together, only to break up again. Newman, reading the cannibalism themed story Alive!, finds the smell of a cooked Kramer appealing. Jerry is informed that Bania is going to follow him on the NBC showcase. George sprains his good leg and Jerry discovers that George is a closet Bania fan. Kramer tries to keep his skin moist but the baked in smell of cooked meat is too much for Newman. George manages to keep up his bluff until he tries to take on some old-timers. Jerry plans to sabotage his own act, surmising that Kenny\'s act will also bomb, but Kenny gets the last laugh.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Voice', 9, 2, 'Yes', 'Yes', 'Yes', 3, 10, 1997, 'George\'s employer wants to get rid of him, since they now know he isn\'t really handicapped and they don\'t like him. He has a one-year contract with Play Now that he will make sure they honor by him showing up for work every day. Jerry and George mock the sounds the Jerry\'s girlfriend Claire\'s stomach makes during the night. Jerry envisions the belly button as the mouth and the sound the stomach makes its voice. Because of the \'bump into\' Jerry tells Elaine that she is destined to backslide into her relationship with David Puddy, she bets him $50 that she won\'t. The next day Jerry discovers that Elaine didn\'t go home last night, he accuses her of seeing Puddy. She says the sex they had was an isolated incident. Jerry agrees but the dinner they also had was more of a commitment, he demands that she pay up. Kramer is tired of seeing all his ideas implemented, because all the little day to day incidental things keeps getting in his way and keeping him realizing his ideas. He gets an intern from NYU to help him out with Kramerica Industries; the corporation he had previously setup to develop some of his ideas. With this help he\'ll be freed from the day-to-day activities and be able to develop his ideas, such as the oil tanker bladder. Meanwhile, George is fighting the siege mentality that he is encountering at work and Elaine just can\'t get Puddy off her mind. No matter what the obstacle, George endeavors to occupy his office. Jerry tells Claire about the voice and she leaves him. The university takes Kramer\'s intern away from him. Claire says they can get back together if he won\'t do the voice ever again, he decides the voice is worth it. Unfortunately, everyone is tired off the voice. Elaine pays ups and they decided on a double or nothing bet. The intern comes back on his own because he believes in Kramerica. Play Now tries to negotiate with George, but he won\'t give in. Later, he offers his office and one of their rubber balls to allow Kramer to test his oil bladder idea. Jerry continues to cash in on his bet with Elaine, who just can\'t seem to keep away from Puddy. The big test takes place at George\'s workplace where Jerry plans to meet Claire. They try to warn her about the falling object, but all she hears is the voice. The lawsuit that is filed by Claire puts Play Now out of business and George out of his contract.', 'Y', 'N', 8.8),
	('Seinfeld', 'The Serenity Now', 9, 3, 'Yes', 'Yes', 'Yes', 9, 10, 1997, 'Frank is supposed to say \'serenity now\' every time his blood pressure is in danger of going up. Jerry\'s girlfriend gives his Knicks tickets away. She comments that she has never seen him get \'real mad.\' George gets Kramer to help him fix his parents\' screen door. They remove the old door and Kramer takes it with him. Frank is selling computers; he wants to bring George into his business. Lippman\'s boy tries taking advantage of becoming a man at his bar mitzvah by using his tongue while kissing Elaine. Kramer installs the screen door outside his apartment to give his apartment \'the cool even breezes of Anytown, USA.\' His initial instinct is to quit, but George decides it is finally time to take on his arch-nemesis, Lloyd Braun, whom Frank has also hired to sell computers. When Jerry learns how to get mad, it releases all his other feelings, including caring and another that results in a proposal. Kramer fights with the neighborhood kids of \'Anytown, USA.\' George tells Elaine she is attractive to the Lippman men because of her \'shiksappeal.\' The result gets her two Lippman \'men\' who want to denounce their religion. George hatches a scheme to sell more computers; however, continual use of the phrase \'serenity now\' has an \'impact\' on computer sales. The release of emotions from George has an impact on emotional Jerry. Elaine seeks help from a \'rabbi\' to see if she can reduce her \'shiksappeal.\'', 'Y', 'N', 9.1),
	('Seinfeld', 'The Blood', 9, 4, 'Yes', 'Yes', 'Yes', 16, 10, 1997, 'Jerry has an encounter with an Exacto knife and ends up having an infusion of 3 pints of Kramer\'s blood infused into him because Kramer decided to store his blood. Jerry\'s parents buy him sessions with personal trainer, Izzy, who\'s going to help him work off his spare tire because they are concerned with his lack of exercise. George decides that adding television and food to his equation will make sex even better. Elaine visits her friend Vivian and is disappointed when Vivian implies that she isn\'t responsible enough to watch her son Jimmy, so she works overtime to prove how responsible she is.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Junk Mail', 9, 5, 'Yes', 'Yes', 'Yes', 30, 10, 1997, 'Jerry\'s childhood friend \'Fragile\' Frankie promises to get Jerry a new car because of a show he did for Frankie\'s car dealership. George prepares for his weekly call to his parents. Kramer plans his revenge on a company because of the over abundance of catalogs they\'ve sent him in the past month. Elaine is back with Puddy, but meets the man of her dreams at the diner and plans to keep Puddy in reserve until she finds out if the new guy can \'handle the workload.\' Kramer gets deluged with more catalogs and plans to stop the mail. George\'s parents cut him short on his weekly phone call. Jerry gets a van and not the Saab he\'d hoped for. Frankie reminds him of the childhood dream they had where they got a van a toured the country. George pops in on his parents and reminds his parent\'s they didn\'t call him back, but they have to leave right away. Kramer bricks up his mailbox, but that doesn\'t stop his mail from being delivered. Jerry plans to sell the van; Kramer helps him out with the ad copy that cites interesting trades considered. Kramer goes to the post office to permanently cancel his mail. Newman confesses to him that no one really needs their mail but that there is a greater conspiracy at work. George demands to know what\'s going on with his parents; they tell him they are cutting him loose. George isn\'t ready for abandonment; he plans to date his cousin as a means of getting his parents involved in his life. Jerry determines that the appeal Elaine finds in her new boyfriend comes from some old commercial that he appeared in. Kramer wants Jerry\'s van and offers Anthony Quinn\'s old tee shirt as an interesting trade. Elaine wants Puddy back, but is rejected by him. Kramer uses the van to launch his anti-postal campaign. George\'s cousin is into their relationship; however, George schemes to have his parents catch him making out with her. Kramer is captured and enlightened by the postmaster general. Elaine\'s boyfriend gets his second piece of good news in one day, his TV career has been revitalized and she is taking him back. Jerry must sell the van after seeing what they saw.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Merv Griffin Show', 9, 6, 'Yes', 'Yes', 'Yes', 6, 11, 1997, 'After Kramer finds the set of the old Merv Griffin Show in a dumpster, he begins to treat his entire life like a talk show. Jerry\'s new girlfriend has a priceless toy collection that she won\'t let him play with, which leads him to some questionable behavior. George runs over a squirrel with his car, and he\'s forced to spend time and money on its recovery. Elaine has to find a way to deal with a new co-worker, whose \'sidling\' is both annoying and potentially dangerous to her job.', 'Y', 'N', 9.1),
	('Seinfeld', 'The Slicer', 9, 7, 'Yes', 'Yes', 'Yes', 13, 11, 1997, 'Elaine is having nightmares and sleepless nights due to her neighbor\'s inconsideracy. The neighbor is out of the country and has left her alarm clock set for 3:30 a.m.. George gets a dream job at a very badly run company, his new boss seems familiar to him, then a photo in the boss\'s office reminds him of \'the boom box incident.\' Fearing that he might lose his new position, George listens to Kramer\'s advice and plots to get hold of the photograph and get it retouched. Kramer\'s dissatisfied with the meat he is getting with his sandwiches, so he obtains a meat slicer. Kramer suggests Elaine that she short circuit her neighbor\'s apartment and blow the circuit breaker. Jerry is going to go out on a date with a doctor that Elaine recommended, but the date is annoying when the doctor can only talk about saving lives. The photo lab screws up the retouching by eliminating the boss from the photograph and not George. Jerry discovers the doctor is dermatologist. George recommends a carefully orchestrated revenge date. Kramer uses the meat slicer to help Elaine feed the neighbor\'s cat; the power outage shut off the automatic feeder. Jerry\'s revenge date goes well, until he is reminded of the phrase \'skin cancer.\' Elaine is still using the slicer and finds it very handy, until she tries to even her high heels. George goes back to the photo shop to find they put the boss back in the photograph as a cartoon. He now needs to obtain a new bare-chested photo of his boss or find a new job, perhaps the Coast Guard. Jerry\'s doctor date would provide the perfect opportunity for him as she does skin cancer screenings. Elaine keeps the slicer problem from Kramer by threatening him with seeing some circus clowns. Later, Kramer goes to her apartment to pick up the slicer; she fixes it and quickly shoves it out the door. Kramer sees the dinged up blade and tries to get back into her apartment, but he takes the knob of the door. Jerry has developed an allergic reaction to something as hives have broken out on his neck. Elaine discovers she is trapped inside her apartment. Jerry goes down to George\'s workplace and confronts the doctor about his hives. She leaves and Kramer, in his white meat slicing coat, steps in as the skin cancer doctor and spots a growth on George\'s boss. George gets his bare-chested photo. Kramer wants to come clean about the growth; George tells him he will tell his boss to see another doctor. George\'s boss doesn\'t think it is a problem, a ten-year-old photo of him shows the mole, it hasn\'t changed. He also relates to George the story about the dumb guy on the beach with the boom box. He mentions to George (as others have) that he sure has lost a lot of hair in the past ten years. Despite all of that, he gets to keep the job. Later, the guys keep Elaine company as they wait for the locksmith to come and open her apartment.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Betrayal', 9, 8, 'Yes', 'Yes', 'Yes', 20, 11, 1997, 'Jerry, George and Elaine return from their trip to India that they don\'t want to talk about. Sue Ellen calls the wedding off and Nina doesn\'t want George or Jerry. George finds out that Jerry slept with Nina and Elaine slept with the groom. Kramer and FDR settle their score, a snowball with something extra. Jerry \'schnapps\' Elaine to find out why George is so bitter with him. Kramer tries to out wish FDR. Elaine, Jerry, George and Nina arrive in India, where Elaine discovers that the groom is someone she slept with and that they are the only people from the U.S. who are attending the ceremony. Kramer is angry with Newman because he didn\'t use his birthday wish to save Kramer from FDR. George \'schnapps\' Elaine to find out the secret Elaine is keeping about Jerry and Nina. Elaine buys tickets to India to spite Sue Ellen by showing up at her wedding. Kramer tries to get Newman to use his birthday wish to protect Kramer from FDR. Elaine finds that Jerry and Nina have just slept together. Elaine meets the parents of Sue Ellen\'s fiancee who try to convince her not to go to India for the wedding; after all they aren\'t even going. Jerry and Nina suffer an awkward pause in their conversation. Kramer confronts FDR about his birthday wish. Elaine\'s mail from India is an \'unvitation\' to Sue Ellen\'s wedding in India to someone whose name seems familiar to her. George asks Jerry to call Nina about setting them up on a date and realizes he must where his Timberlands every time he sees her. Jerry and George are walking down the street and they run into Nina and old girlfriend of Jerry\'s whom he never slept with. Kramer attends FDR\'s birthday and FDR gives him an evil eye right before blowing out the candles on his cake. Elaine receives an item in the mail from India. Two years earlier, Jerry tells George and Susan that Nina might be the one; Kramer nails FDR in the back of the head with a snowball; Elaine is dating an Indian man named Peter (Pinter). Eleven years earlier, new resident Jerry tells his neighbor across the hall, whom he calls Kessler (it\'s the name on the mailbox), that what\'s mine is yours.', 'Y', 'N', 9.2),
	('Seinfeld', 'The Apology', 9, 9, 'Yes', 'Yes', 'Yes', 11, 12, 1997, 'Jerry\'s girlfriend walks around his apartment naked; she even eats breakfast and plays Scrabble naked. An old friend of the gang named Jason is going through Alcoholics Anonymous (AA) and is currently working on step 9, where you make amends to individuals for past wrongs. George is anxious to receive Jason\'s apology for the humiliating neck-hole incident. Elaine is offended when her co-worker, Peggy, can\'t tolerate Elaine\'s germs, but easily tolerates the germs of other people. Kramer discovers he\'s been taking too long in the shower, so he tries to make some changes to his shower routine. Jerry comes to realize there is good naked and bad naked, when he sees his girlfriend coughing. Jason stops by the restaurant to apologize to Jerry, but fails to apologize to George. George confronts him later, only to be humiliated some more. Kramer changes don\'t work out, so he asks for advice from Jerry and observes the men in the shower at a health club. Elaine confronts Peggy and gives her some germs. George tells Jerry how he can show his girlfriend the concept of bad naked using a belt sander. Kramer decides to live in the shower. George talks to Jason\'s sponsor, who recommends that he attend a meeting, only it\'s not AA, it\'s Rage-oholics Anonymous (RA). Jerry executes George\'s plan. After doing his dishes in the shower, Kramer decides he needs to add a garbage disposal to bathtub. Kramer calls on Puddy for installation advice. Elaine tells Jerry one of the problems with his body and why a naked male body isn\'t attractive. Puddy tells Elaine why her co-worker doesn\'t like her germs, she\'s a \'germ-o-phobe,\' like he used to be ten years ago. He accompanies Elaine on a visit to Peggy to prove his theory. Jerry convinces his girlfriend to put on her clothes; however, he can only picture her naked and unfortunately she can only do the same with him. Kramer cooks up a meal that he serves to Elaine, Puddy and the recovering Peggy, only they all react badly when they find out the kitchen was in the shower. Jason tries to apologize to George, but it isn\'t quite what George had in mind so they both go into a rage.', 'Y', 'N', 8.5),
	('Seinfeld', 'The Strike', 9, 10, 'Yes', 'Yes', 'Yes', 18, 12, 1997, 'George, Elaine and Jerry attend Tim Whatley\'s Hanukkah party. Jerry meets an attractive woman with whom he sets up a date. Elaine meets a man in a bad denim vest and gives him her fake number. George is offended by Whatley\'s gift to him, a donation in his name to a charity. George is also reminded of the Festivus holiday his father created many years ago. Elaine\'s quest to become a submarine captain and get her free sub sandwich is ruined when she realizes she used her punch card at the party to give her fake number to the denim vested guy. Kramer gets word he can return to his job at the bagel place, it seems he has been on strike for the past 12 years. Elaine goes to the place, an off-track betting parlor, that her fake number reaches. She wanted to give them her real number, so when the denim vest guy calls, she can connect with him. The men at the parlor are interested in connecting with her, so she gives the number for the bagel shop where Kramer is working. Jerry meets his date, Gwen, at a restaurant, but it turns out she is two-faced. Sometimes Gwen looks great, other times she\'s plain; it all depends on the viewer\'s angle and the lighting. George decides to use the Whatley approach when giving out Christmas gifts at Krugers; however, he makes up his own charity called the \'Human Fund.\' Kramer is intrigued by the concept of the Festivus holiday and contacts Frank, who becomes excited at the prospect of rekindling \'Festivus for the rest-of-us.\' Kramer asks to get the 23rd of December off, when he can\'t get it, he resumes the strike; meanwhile Elaine waits at the bagel place for a phone call from the denim vest guy. The look of Jerry\'s girlfriend keeps changing. Jerry decides that Gwen looks best in the back booth at Monk\'s, something she grows to dislike. George passes out his gifts at Krugers and reaps great rewards. Kramer warns Elaine about the sabotage he committed; the bagel place becomes very steamy and makes Elaine look ugly. Kruger gives George a check for donates $20,000 to the \'Human Fund\' and later accounting informs him the charity doesn\'t exist. Gwen finds out from Kramer that Jerry is seeing another woman, Kramer has seen her and she\'s not Gwen. Gwen thinks Jerry is two-timing her with an ugly woman. George tries to convince Kruger that he passed out the fake gift cards because he didn\'t want to be ridiculed for the holiday his family traditionally celebrates, Festivus. To prove it, George brings Kruger to his father\'s Festivus dinner, where everyone comes together.', 'Y', 'N', 8.9),
	('Seinfeld', 'The Dealership', 9, 11, 'Yes', 'Yes', 'Yes', 8, 1, 1998, 'Jerry plans to buy a new car with an insider deal from Puddy, who\'s been promoted to a car salesman. Jerry ends up bargaining with Puddy and Elaine to get them back together so he can get a better deal on his car. Kramer takes the car Jerry is planning to buy for a test drive with another salesman, and decides to see how far past empty the gasoline can go. George seeks out something to eat and must settle for a vending machine candy bar, which ends up getting stuck. After George leaves and comes back, George suspects a mechanic of stealing the candy bar. Then George comes up with a creative idea to implicate the mechanic.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Reverse Peephole', 9, 12, 'Yes', 'Yes', 'Yes', 15, 1, 1998, 'Puddy is wearing what can only be described as a \'man fur.\' Jerry and Elaine leave it to George to sniff them out a deal on a massage chair, for an apartment warming gift for their friend Joe Mayo. Elaine doesn\'t like Joe\'s parties, because he always gives his guests an assignment. Kramer and Newman are going to reverse the peepholes on their doors. The landlord wants to evict Newman, because he is an agitator. Jerry decides to go wallet-less. George is opposed to the idea; he keeps everything in his wallet. Jerry, George, Elaine and \'man furred\' Puddy go to the party and get their assignments. Elaine, who is in charge of the coats, decides to throw \'Dr. Zaius\' (Puddy\'s coat) out the window. Kramer comes to Newman\'s defense with the landlord. Joe Mayo has the same kind of coat that Puddy had, so he wants Elaine to replace the coat, after all she was in charge. George complains about back problems that Jerry attributes to the size of his wallet. The massage chair gets delivered to George\'s apartment. Wallet-less Jerry must carry all his girlfriend\'s stuff, when they go out on their date. Newman admits to Kramer that he is sleeping with the landlord\'s wife. Kramer and Newman find Puddy\'s coat hanging in a tree. Jerry complains about carrying all his girlfriend\'s stuff and Elaine tells him about Peterman\'s small men\'s carryall. \'It\'s not a purse, it\'s European.\' Elaine decides she is out of the gift, if she has to replace the coat. George is enjoying the new chair and lies about getting the chair. Elaine finds out that Newman has Puddy\'s coat and she invites Newman to her apartment. Despite Elaine\'s come-ons, Newman won\'t give up the coat, he has given it to the landlord\'s wife. The landlord confronts Kramer, when he discovers the fur coat. Kramer says that it belongs to Jerry, because he is one of those insecure entertainers. Kramer convinces Jerry to wear the coat in front of the landlord. George continues to lie about the receiving the gift. Jerry drops out of the gift, when he finds out that Joe Mayo didn\'t like the music he provided at last year\'s party. Kramer was never in the gift, he just thought it was a good idea for a gift, he doesn\'t even know Joe Mayo. George will be able to return the chair, after he has the receipt in his wallet. Out on the street, George\'s wallet explodes. Jerry goes out on the street in the fur coat, where his \'purse\' is stolen and the landlord finds out the truth about the coat. Puddy gets a new coat.', 'Y', 'N', 8.7),
	('Seinfeld', 'The Cartoon', 9, 13, 'Yes', 'Yes', 'Yes', 29, 1, 1998, 'Kramer\'s brutal honesty gets Jerry in trouble with Susan\'s old college roommate, Sally Weaver. Elaine obsesses over the meaning of a cartoon that appears in The New Yorker. Elaine and later Kramer comments that George\'s new girlfriend looks a lot like Jerry. In fact Kramer says \'just because they look-a-like, that doesn\'t mean you\'re (George) secretly in love with Jerry.\' Jerry confronts Kramer\'s frankness. Sally claims that Jerry has ruined her life, she\'s quitting the business, Jerry can\'t have that on his conscience, he talks her back into the business. Kramer makes an important life decision, the only way to keep his mouth shut, is to stop talking. Before he finally stops talking, Kramer\'s constant references to the looks of George\'s girlfriend, drives George out of Jerry\'s apartment. Elaine goes to The New Yorker to seek an explanation for the cartoon. Discovering that the editor didn\'t understand the cartoon either, he liked the kitty. Sally opens her new one woman show about \'Jerry Seinfeld- the Devil.\' Elaine\'s complaint, gets her the opportunity to do her own cartoon for the magazine. Jerry confronts Sally about the content of her show. Newman is her biggest fan; finally, he can see a \'show that is about something.\' Kramer discovers the disadvantages of not talking. George worries about why he really likes his girlfriend. A clip of Sally\'s show appears on channel 9 news, it features Jerry\'s latest confrontation with her. Elaine works all-night on her first cartoon, it is okay, but it is not the gem that Elaine thinks it is. Jerry calls Sally and the message he leaves on her answering machine appears in her show as well. Later the lawsuit he filed appears in her cable special. Jerry decides to cut off all communication with Sally. Elaine\'s first comic appears in The New Yorker. Peterman thinks it is a great cartoon, until he realizes it is a Ziggy and he can prove it -- \'Quick Elaine, to my archives.\' George and his girlfriend discuss their relationship, until she gets gum in her hair. Sally starts talking to the silent Kramer, until he can\'t take it anymore. He tells her to shut-up, then he apologizes and says that he hasn\'t spoken for days. Sally tells him to lay it on her. To remove the gum from her hair, George\'s girlfriend cuts her hair, her new hairstyle looks exactly like Jerry\'s. George runs out of the apartment screaming. Elaine tells Jerry about the Ziggy incident. Ziggy responds to The New Yorker. Sally\'s new cable show is about to come on and Jerry is convinced she\'ll have nothing to talk about. He was so wrong. George decides to take a few days off from his relationship with Jerry.', 'Y', 'N', 8.2),
	('Seinfeld', 'The Strong Box', 9, 14, 'Yes', 'Yes', 'Yes', 5, 2, 1998, 'George tries to break up with his girlfriend, Maura, only she doesn\'t agree. Jerry has purchased cuff links worn by Jerry Lewis in Cinderfella. He plans to use them as a conversation starter with Lewis when he goes to an upcoming roast at the Friar\'s Club. Having the same first name isn\'t enough. A man of mystery that she has met intrigues Elaine. Jerry suggests that perhaps he is a super-hero. With robberies occurring in the building, Kramer has obtained a strongbox to hold his valuables. He needs to find a place to hide his key. A place that no one knows, except him. His first place doesn\'t work. George lays out all of the reasons that they should be officially broken up, Maura still doesn\'t agree \'to turn the key.\' Elaine gives up on her mystery man when he runs from a woman that Elaine deduces is his wife. She returns to Jerry\'s apartment to find that his intercom is broken. So she shouts to him from the street, about the mystery man, while she waits for the opportunity to get into his building. Jerry inspects his intercom, only to find Kramer\'s strongbox key hidden inside. Kramer hides his key again. Jerry finds the key again and decides to go down to let George in. While downstairs, a neighbor who\'s forgotten his key and is unknown to Jerry asks to be let in. Jerry denies him entry. Elaine goes to the mystery man\'s shabby apartment and discovers he is poor and on welfare. The woman he ran from is his welfare caseworker. Jerry discovers the keyless neighbor, does in fact live in his building, on the 5th floor in apartment 5E (!) right next door to Kramer. Elaine tells Jerry about her mystery man\'s super powers. George decides that cheating on Maura might be his ticket out. Kramer lets Phil, Jerry\'s \'new\' neighbor, keep his parrot in the hallway. Kramer also hides his key at Phil\'s. Glenn, the mystery man, takes Elaine on a date in the alley. Jerry needs his cufflinks for the roast, only to find out that Kramer has locked them in his strongbox. The key to the strongbox was hidden in the parrot\'s food dish, only now the parrot is dead (from food poisoning) and buried in a pet cemetery. George tries getting caught with the other woman, only both women agree that they can work with George through this incident. Elaine discovers that Glenn is, in fact, married. Kramer and Jerry go to the pet cemetery to exhume the key, his neighbor catches only Jerry. George asks what\'s in the cooler (strongbox) as he easily opens it up.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Wizard', 9, 15, 'Yes', 'Yes', 'Yes', 26, 2, 1998, 'Jerry buys his dad a $200 Wizard organizer for a birthday present. George receives a message from Susan\'s parents, the Rosses. Jerry and George debate about the race of Elaine\'s new boyfriend and that intrigues her. George returns the call from the Rosses; the Foundation is having an event this weekend, but George can\'t attend, he has to close on his house in the Hamptons. Kramer announces his retirement, a Hollywood big shot has optioned his coffee table book about coffee tables. Elaine finds evidence that leads her to believe her boyfriend is black. Susan\'s parents see George on the street in the city, during the time he is supposed to be in the Hamptons. Jerry is woken up early in the morning at his parent\'s house and gives his father the \'$50\' organizer that has many features besides a tip calculator. Later he discovers that Kramer has moved down there, to join the other retirees. Elaine laughs when Susan\'s parents ask her about George\'s house in the Hamptons. Of course, George just builds on the lie. Morty, who can\'t run for president of the condo association, decides that Kramer should run for condo board president of Del Boca Vista phase III. Once Kramer is elected, Morty will run things from behind the scenes. Elaine schemes to try to determine her boyfriend\'s race. George finds out the Rosses knew that he lied. He decides to take them to the Hamptons, to \'see who\'ll blink first.\' Kramer begins his campaign and the Boca Breeze has good things to say about him. When Elaine\'s boyfriend says they are an interracial couple, she is convinced he is black. George keeps building on his lie, as he picks up the Rosses and takes them on their ride to the Hamptons. Kramer receives some bad press from the Boca Breeze; it\'s damage control time. Kramer suggests buying each member of the board one of those Wizard tip calculators. Jerry knows he can\'t get the deal he told his father he\'d received, but Kramer says not to worry, Bob Saccamando\'s father lives down here and can help them out. Elaine and her boyfriend discover that each is not the race they thought the other was. Saccamando\'s father comes through with knock-off tip calculators called Willard, they are defective and the election is lost. George and the Rosses reach the Hamptons, where the truth wins out.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Burning', 9, 16, 'Yes', 'Yes', 'Yes', 19, 3, 1998, 'Elaine thinks that Puddy is religious because of the presets she discovers on his car radio. The first idea George presents at a Kruger project meeting goes over great, his follow up suggestion isn\'t as well received. Jerry suggests that George use the old showmanship trick of leaving on a high note. Elaine tells George and Jerry about her suspicions; George suggests that she reset his radio presets as a test. Kramer and Mickey get an acting gig playing sick for some medical students. Jerry\'s girlfriend, Sophie, calls him with the familiar \'it\'s me\' greeting only he doesn\'t recognize her voice. George leaves a Kruger meeting on a high note. For their acting job, Mickey gets bacterial meningitis and Kramer has gonorrhea. Elaine confirms that Puddy is religious. Kramer picks up on the showmanship idea and really plays up his gonorrhea part. Sophie leaves an \'it\'s me\' message on Jerry\'s answering machine. George suggest he call her back with the \'it\'s me\' greeting. Sophie doesn\'t recognize Jerry\'s voice and thinks he is someone else; Jerry discovers that she hasn\'t told him about the tractor story. Puddy doesn\'t have a problem with Elaine not being religious, after all he is not the one who\'s \'going to hell.\' George and Jerry speculate on what the tractor story is. Elaine begins to worry about going to hell. Kruger throws everyone off the project because they are boring, so now George is the only other member of the project team. Kramer receives rave reviews for his portrayal of gonorrhea, but now he feels he has been typecast. Jerry sees a scar on Sophie\'s leg and assumes it was from a tractor accident. George finds that he has to do all the actual work on the project as Kruger keeps making excuses and doesn\'t do any actual work. Puddy wants Elaine to steal a paper, after all she is already going to hell and he doesn\'t seem to care. Kramer takes Mickey\'s ailment. Elaine and Puddy seek the advice of a priest about where their relationship is going. Sophie tries to tell Jerry the tractor story, but he tells her not to worry about it. Kramer and Mickey come in arguing about getting gonorrhea and Sophie clears it up for both of them. With that, Jerry leaves on a high note. Meanwhile, back at the project meeting, Kruger decides to leave George on a high note.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Bookstore', 9, 17, 'Yes', 'Yes', 'Yes', 9, 4, 1998, 'Kramer \'hangs-out\' more than usual at Jerry\'s place. Jerry spots Uncle Leo shoplifting. George takes a large book into the bathroom with him. Kramer and Newman plan to implement Kramer\'s idea for running a rickshaw service in the city. Elaine is at the annual Peterman party, where everyone is anxious to know if she is going to dance again and when. She ends up getting drunk and making out at a table with another man.', 'Y', 'N', 8.6),
	('Seinfeld', 'The Frogger', 9, 18, 'Yes', 'Yes', 'Yes', 23, 4, 1998, 'Elaine is confronted with cake from two separate birthday celebrations. She is tired of the forced socializing, so she calls in the sick the following day. Jerry & George are going to their old high-school hangout for one last slice of pizza. Kramer was at the police station where he obtained some caution tape used for crime scenes and also hears about a serial killer that is on the loose in the Riverside Park area. At the pizza parlor, George discovers he still has the high score on the old Frogger video game. Elaine\'s co-workers give her a cake to celebrate her return to work from being sick, she refuses to take part in any future celebrations. Jerry goes out with Elaine\'s friend Lisi, but she is a \'sentence finisher, it\'s like dating Mad-Libs.\' George decides to by the Frogger machine, but Jerry asks him how he is going to move it and keep it plugged in to preserve the high score. Kramer discovers the last victim of the serial killer looked a lot like Jerry. George works to find a solution to his Frogger problem and Kramer volunteers the help of a man he knows named \'Slippery Pete.\' Elaine misses the 4 o\'clock sugar rush she had gotten used to from all the celebrations, so she decides to raid Peterman\'s refrigerator, where she finds a piece of cake. She finds out from Peterman that the piece of cake he has in his refrigerator is worth $29,000 because of its historical significance. The cake comes from the 1937 wedding of King Edward VIII. Jerry is looking to breakup with Lisi, but discovers that she lives in Riverside Park area. To avoid the serial killer, he takes Lisi back to his place where she finishes one of his thoughts that takes their relationship to the next level. Elaine tells Jerry and George about the cake and she also tells Jerry that Lisi is planning a weekend trip for them to Pennsylvania Dutch country. Jerry fears that Lisi received the wrong message as that kind of a trip is for a serious relationship. Elaine tries to even out Peterman\'s slice of cake, but gets swept up in the moment and finishes it off. George tries to coordinate the movement of Frogger machine. Elaine looks for a replacement for Peterman\'s cake, Kramer suggests an Entemann\'s cake. Jerry goes to Lisi\'s apartment, where he tries to break up with her. It goes on for ten hours, when he is ready to leave he discovers it is dark out. After exiting her apartment, he sees a man whom he fears is the serial killer and pleads to be let back in. Peterman has his piece of cake appraised at $2.19. When George finds \'Slippery Pete\' playing his Frogger game on battery power; it is discovered there only about three minutes of power remaining. The only available power source is across the busy street and Kramer has run out of caution tape. It\'s up to George to get the Frogger machine across the street; however there is no chance of a high score in this game. Later, Peterman shows Elaine surveillance videotape of her eating and \'dancing\' with the slice of cake; he is convinced that the age of the cake and its effect on her digestive system are all the punishment she needs.', 'Y', 'N', 9),
	('Seinfeld', 'The Maid', 9, 19, 'Yes', 'Yes', 'Yes', 30, 4, 1998, 'George searches for a nickname and decides on \'T-bone.\' Jerry has hired a maid to clean his apartment. Elaine suspects there is more than cleaning going on. Kramer\'s girlfriend is moving downtown (10 minutes by subway) to a different way of life. Kramer tells Elaine he is having a fax sent to her apartment, only Elaine informs him that she doesn\'t have a fax machine. George makes a play for being called \'T-bone\' at work, but a coworker gets the honor. Elaine gets home to find 57 messages waiting for her, most of them the fax machine trying to deliver Kramer\'s fax. Elaine catches Jerry kissing the maid. Jerry confesses that he has a personal and work relationship with his maid named Cindy. Kramer\'s girlfriend is gone and he tells Elaine that he signed up for a food delivery service. They\'re going to fax him menus for all the restaurants for the next year. Elaine gets a new number and with it a new area code, she really wanted a \'changed\' number. Kramer and his girlfriend have a relationship by phone. George finds out about Jerry and his maid. Elaine tries to give out her new number to a guy, but the new area code scares him off. George wants his nickname and confronts his coworker, Kruger sees George\'s gestures through a window and it reminds him of \'Koko the Monkey.\' Elaine finds out a woman in her building has died, she had a telephone number with a 212 area code. When Cindy takes her fee but leaves without cleaning anything, Jerry wonders what he\'s paid for. Kramer calls him \'a john.\' George and Jerry swap information on their respective situations at Monk\'s counter. Kramer returns from visiting his girlfriend and reports the oddities he saw there. The gang tries to communicate while sitting at Monk\'s counter. Jerry\'s maid tells George that there is woman at the cleaning service named Coco. George sees this as an opportunity to get out from under this nickname. Jerry breaks up with and fires Cindy. Elaine gets the dead woman\'s number and receives her first phone call from the woman\'s grandson who hasn\'t been told she\'s dead. Kramer breaks up with his girlfriend and she throws him out. He gets lost downtown and calls on Jerry for help. While going to rescue Kramer, Jerry is confronted by his Cindy\'s pimp-like boss. He says that Jerry must pay Cindy. Elaine convinces the grandson that his grandma is dying, the boy calls 911. Jerry spots Cindy walking down the street and tries to pay her but gets busted by the police. Elaine\'s door is broken down by the fire department. Cindy\'s boss picks up Kramer and it might lead to a new career in cleaning. George gets out from under being \'Koko,\' only to get another nickname, \'Gammy.\'', 'Y', 'N', 8.3),
	('Seinfeld', 'The Puerto Rican Day', 9, 20, 'Yes', 'Yes', 'Yes', 7, 5, 1998, 'The gang tries to get back into town after leaving the Mets game early in the 8th inning, the Mets are down 9 - 0. On the highway they run into trouble with a maroon Volkswagen Golf. George comments on a new movie he saw about the Hindenburg disaster and the clever comment he made during a quiet moment after the explosion. As they approach 5th Avenue traffic slows down and music can be heard, they realize they have forgotten about the Puerto Rican day parade. Elaine worries about getting home and seeing 60 Minutes as part of her weekend wind down. Kramer spots a way out if Jerry can worm his way over to the right. They almost make it over until they reencounter the maroon Golf. Elaine bails out of the car to find alternate transportation. George bails out of the car when he spots a theater screening the Hindenburg movie; he decides he wants to repeat his glory. Elaine decides the cab she hired isn\'t working, so she bails out of the cab, only to have it start moving again and again. George\'s attempt to be funny at the movie is undermined by a guy with one of those funny laser pointers. Kramer suggests that he and Jerry abandon his car. The laser pointer guy (a lousy prop comic) gets all the laughs as George\'s line bombs and he is humiliated. Kramer cuts a deal with the maroon Golf they are go to get access to the short cut when Jerry makes an apology wave. George returns to the car with the red dot of a laser pointer appearing all over parts of his body. Jerry rescinds his apology wave just as he is about to pull in the alley; Elaine arrives back at the same spot in her cab. Jerry\'s apartment is seen, but no one is home. Elaine seeks an alternate way home. Kramer seeks a bathroom. Elaine works her way over to the parade route and looks for a way across. She leads a group of people on an escape route underneath a reviewing stand ala The Poseidon Adventure. Kramer spots an apartment for sale and poses as H.E Pennypacker, a wealthy industrialist, to get access to a bathroom. When he gets back he tells Jerry about the Mets game. Soon after, Kal Varnsen (Jerry\'s alias), is looking at the television in the apartment. George spots the laser guy and plans a sneak attack. Elaine\'s route leads to a dead end. George grabs what he thinks is the laser pointer and gets ink all over his hands. Kramer accidentally sets the Puerto Rican flag on fire and a mob of people, led by the armoire stealing tough guys. Art Vandelay seeks the use of a bathroom to clean the ink off his hands and runs into Varnsen. Pennypacker joins them on the run from the mob. Varnsen wants know who\'s watching the Saab factory. The mob is watching it; however, they leave it in a precarious position.', 'Y', 'N', 8.4),
	('Seinfeld', 'The Chronicle - 1', 9, 21, 'Yes', 'Yes', 'Yes', 14, 5, 1998, 'Jerry, Elaine, George & Kramer plan to go to the movie, but Jerry takes out a little time to look at nine years of memories. Featuring relationships (getting in & out), etc.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Chronicle - 2', 9, 22, 'Yes', 'Yes', 'Yes', 14, 5, 1998, 'More clips are seen and finally the closing minutes feature a series of bloopers and a musical montage that features the song \'Good Riddance (Time of Your Life)\' by the band Green Day, from their 1997 album Nimrod.', 'Y', 'N', 8.3),
	('Seinfeld', 'The Finale - 1', 9, 23, 'Yes', 'Yes', 'Yes', 14, 5, 1998, 'Jerry and George discuss the movies and George\'s desire to get his fifteen minutes of fame. Kramer is off to the beach. Elaine calls a friend, whose father is in the hospital, with her cell phone; Jerry and George tell her that is a social faux pas. Jerry gets a message from NBC that they want to talk about the pilot. So Jerry and George go to meet with the new vice president of programming, who is interested in turning their pilot into a 13 episode series. Jerry and George begin to make plans to move to California. Jerry interrupts Elaine\'s phone call to her friend to tell her about the NBC deal. When he finds out what she did, he tells her that was an even greater faux pas than the cell phone. Jerry and George\'s parents are excited by the news about the NBC deal. NBC offers Jerry & George a perk, free use of one of their private jets to anywhere they want. Kramer returns from the beach, but has a little bit of water trapped in his ear. Kramer warns they\'ll never come back from LA, \'she\'s a seductress.\' Hey! He did. The foursome decides where they want to take the private jet. They finally decide on Paris. As they are ready to leave, Elaine plans to call her friend again; Jerry tells her it is not right to rush that kind of phone call. Elaine avoids a faux pas. Newman begs to be brought along, when Jerry denies him, he vows to be there at Jerry\'s day of reckoning. The private jet, except for George who wanted the one Ted Danson would have gotten impresses everyone. With water still in his ear, Kramer tries to get it out mid-flight. He stumbles into the cockpit and the plane starts going into a crash dive. During the descent, George confesses he cheated during \'the contest\' and Elaine and Jerry are about to tell each other something important, when the plane corrects itself. The plane puts down in the small town of Latham, Massachusetts for a checkup. The foursome goes into town and debates about if they are going to get back on the plane. They witness the robbery of a fat guy, which they all mock and Kramer videotapes. They are arrested under the Good Samaritan law established by the town. They are looking at a fine of a maximum of $85,000 and up to five years in prison. The guard assumes they are going to be prosecuted since this is the first offense of this kind in the country. Jackie Chiles is called in for their defense. The prosecution decides to look into the past of these four and build a case that will destroy their characters. Rivera Live covers the trial. Jerry and George\'s parents prepare to go to Latham for the trial. Newman (who\'s absolutely delighted), Uncle Leo, Peterman, Puddy, Mickey, Bania, Mr. & Mrs. Ross, Rabbi Glickman, Keith Hernandez and George Steinbrenner also make their way to Latham. Jackie tries to give George a moral compass. The judge, Arthur Vandelay, begins the trial. George thinks the name might be a good sign. The trial begins with opening arguments.', 'Y', 'N', 7.9),
	('Seinfeld', 'The Finale - 2', 9, 24, 'Yes', 'Yes', 'Yes', 14, 5, 1998, 'The videotape Kramer made is played for the jury. When the NBC executives arrive, George forgets about the trial for a moment and complains loudly about the plane. The prosecution begins to call their witnesses and each will do more to break down the characters of the foursome. First, the arresting officer is called to the stand, followed by the victim. Then the prosecution begins to call a variety of familiar faces. Starting with the elderly woman that Jerry stole the marble rye from. The virgin, Marla, is called to the stand and she tells the court about the foursome\'s contest. Further testimony is given by the bubble boy. The woman who needed a handicapped spot. The doctor who was on duty the night Susan died. Sidra, the woman with no implants. Mr. Bookman, the library cop. George\'s former girlfriend Robin, whose apartment caught on fire. The security guard from the parking garage. A detective from when Kramer was dressed like a pimp. The low-talker tries to testify (only she can\'t be heard). Steinbrenner talks about calzone and George\'s communism. The man who runs the cockfights. The pharmacist who sold Elaine a case of contraceptive sponges. A co-worker tells about Elaine\'s Christmas card. Mr. Pitt tells about when Elaine tried to kill him with a pillow. The soup nazi takes the stand and finally Babu Bhatt returns to the US to tell about the cafe and his deportation. They are \'very, very, bad.\' Rivera Live reports that the jury is in deliberation. Meanwhile, the foursome speculates on life in prison. Estelle tries to bribe the judge to be lenient on George if he\'s found guilty. A montage of activity is shown while the jury is in deliberation, that includes people we didn\'t see testifying like the Rabbi, Wilhelm, Keith Hernandez, Bania, Peterman, Puddy, Newman, Mr. Lippman, Poppie, Mr. Ross browsing for a handgun and ends with Jackie Chiles \'cross-examining\' Sidra outside the courtroom. The jury comes back. Jerry asks Elaine what she was going to say to him on the plane as it was crashing. She responds, \'I always loved U-United Airlines.\' The jury returns a verdict of guilty. The foursome shows no remorse as they are sentenced to a year in jail, for doing \'nothing.\' Jackie testifies to Jerry about Sidra\'s lack of implants. As the foursome sits in a prison cell, Jerry comments about the second button on George\'s shirt. A conversation they had nine years earlier on the 5th of July 1989. Jerry closes with a prison-based monologue.', 'Y', 'N', 7.9),
	('Sense8', 'Limbic Resonance', 1, 1, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'Eight strangers from cities around the globe begin having experiences that defy explanation.', 'Y', 'N', 7.5),
	('Sense8', 'I Am Also A We', 1, 2, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'Nomi\'s fortunes take a dark turn, while the rest of the Sensates\' connections become stronger and more dangerous.', 'Y', 'N', 8),
	('Sense8', 'Smart Money Is On The Skinny Bitch', 1, 3, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'With many of the Sensates\' lives becoming more complicated, their newfound gift -- while still a mystery -- proves vital for survival.', 'Y', 'N', 8.3),
	('Sense8', 'What\'s Going On', 1, 4, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'Nomi\'s fate draws nearer, Capheus and Wolfgang\'s fortunes seem to have turned, but Sun is faced with an impossible choice.', 'Y', 'N', 8.9),
	('Sense8', 'Art Is Like Religion', 1, 5, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'The Sensates struggle with intensifying connections, which results in some interesting days on set for Lito and a wedding day surprise for Kala.', 'Y', 'N', 8.3),
	('Sense8', 'Demons', 1, 6, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'While the Sensates bond, Nomi takes a bold move to gain her freedom and Sun makes a choice she might someday regret.', 'Y', 'N', 8.5),
	('Sense8', 'W. W. N. Double D', 1, 7, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'Nomi makes a shocking discovery about her former doctor, while Will gets closer to the truth behind his visions and Kala\'s doubts grow stronger.', 'Y', 'N', 8.6),
	('Sense8', 'We Will All Be Judged By The Courage Of Our Hearts', 1, 8, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'Sun fights to adjust to her new life as Capheus tries to change his. Will and Nomi dig up disturbing information that could change everything.', 'Y', 'N', 8.9),
	('Sense8', 'Death Doesn\'t Let You Say Goodbye', 1, 9, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'Riley learns about her new life and its dangers, Kala deals with the aftermath of the attack on Rajans father, and Lito\'s world spins out of control.', 'Y', 'N', 8.4),
	('Sense8', 'What Is Human', 1, 10, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'Will learns more about his origins and the threat to his future, while Wolfgang\'s actions catch up with him, even as his bond with Kala strengthens.', 'Y', 'N', 8.9),
	('Sense8', 'Just Turn The Wheel And The Future Changes', 1, 11, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'Riley\'s fate draws nearer, while Capheus and Sun are put to the test, and Wolfgang makes his boldest move yet.', 'Y', 'N', 9),
	('Sense8', 'I Can\'t Leave Her', 1, 12, 'Yes', 'Yes', 'Yes', 5, 6, 2015, 'With Riley in the hands of Whispers, all of the Sensates\' skills are needed to give them any chance at survival.', 'Y', 'N', 9.2),
	('Sense8', 'Happy Fcking New Year', 2, 1, 'Yes', 'No', 'No', 23, 12, 2016, 'The journey continues as these eight singular hearts and minds weave in and out of each other\'s lives finding deeper connections, learning darker secrets about one another and struggling to identify with more than just oneself.', 'N', 'N', 8.8),
	('Sense8', 'Who Am I', 2, 2, 'Yes', 'No', 'No', 5, 5, 2017, 'Will and Whispers each race to piece together the other\'s location, while Lito heads to his first movie premiere since the photos leaked.', 'N', 'N', 9.1),
	('Sense8', 'Obligate Mutualisms', 2, 3, 'Yes', 'No', 'No', 5, 5, 2017, 'The Sensates make contact with a key figure in BPO. Ripped from her prison cell, Sun sends out a plea for help. Wolfgang meets an intriguing stranger.', 'N', 'N', 9.3),
	('Sense8', 'Polyphony', 2, 4, 'Yes', 'No', 'No', 5, 5, 2017, 'Kala and Capheus are caught in the middle of angry protests. Lito looks into a journalist\'s disappearance and uncovers new info on Angelica\'s cluster.', 'N', 'N', 9.2),
	('Sense8', 'Fear Never Fixed Anything', 2, 5, 'Yes', 'No', 'No', 5, 5, 2017, 'Bug hits on a solution to Nomi\'s legal troubles, new cracks begin to appear in Kala\'s perfect life, and the Sensates consider a bold change of plans.', 'N', 'N', 9.2),
	('Sense8', 'Isolated Above, Connected Below', 2, 6, 'Yes', 'No', 'No', 5, 5, 2017, 'While Capheus enjoys a welcome surprise, Lito makes a splash at a high-profile event. Riley works to gain the trust of a Sensate she saw at the rave', 'N', 'N', 9.4),
	('Sense8', 'I Have No Room In My Heart For Hate', 2, 7, 'Yes', 'No', 'No', 5, 5, 2017, 'Will asks an old friend for help as Riley embarks on a risky journey. Kala makes a troubling discovery. Sun has an intense encounter in the cemetery.', 'N', 'N', 9.3),
	('Sense8', 'All I Want Right Now Is One More Bullet', 2, 8, 'Yes', 'No', 'No', 5, 5, 2017, 'A familiar face comes back from the dead, a depressed Lito turns to Sun for comfort, and Lila lures Wolfgang into a trap.', 'N', 'N', 9.4),
	('Sense8', 'What Family Actually Means', 2, 9, 'Yes', 'No', 'No', 5, 5, 2017, 'A family wedding stirs up more trouble for Nomi. Daniela goes all out to land Lito the perfect role. One of the Sensates faces a devastating loss.', 'N', 'N', 9.6),
	('Sense8', 'If All The World\'s A Stage, Identity Is Nothing But A Costume', 2, 10, 'Yes', 'No', 'No', 5, 5, 2017, 'Sun moves ahead with her undercover mission, while Lito heads to Hollywood for the audition of a lifetime. Capheus prepares for his first big speech.', 'N', 'N', 9.6),
	('Sense8', 'You Want a War', 2, 11, 'Yes', 'No', 'No', 5, 5, 2017, 'At the gala, Sun braces for a showdown with her brother. Soon a dire new threat sends the Sensates scrambling to save another member of the cluster.', 'N', 'N', 9.7),
	('Sherlock', 'A Study In Pink', 1, 1, 'Yes', 'Yes', 'Yes', 25, 7, 2010, 'A war hero, invalided from Afghanistan, meets a strange but charismatic genius who is looking for a flatmate; it is London, 2010, and Dr. Watson and Sherlock Holmes are meeting for the first time. A string of impossible suicides has Scotland Yard baffled and only one man can help.', 'Y', 'N', 9.1),
	('Sherlock', 'The Blind Banker', 1, 2, 'Yes', 'Yes', 'Yes', 1, 8, 2010, 'A mysterious cipher is being scrawled on the walls around London. The first person to see the cipher is dead within hours of reading it. Sherlock plunges into a world of codes and symbols, consulting with London\'s best graffiti artists. He soon learns that the city is in the grip a gang of international smugglers, a secret society called the Black Lotus.', 'Y', 'N', 8.1),
	('Sherlock', 'The Great Game', 1, 3, 'Yes', 'Yes', 'Yes', 8, 8, 2010, 'A strange clue in an empty room, a blood-soaked car, a priceless Old Master, a deranged bomber. With the clock ticking, the curtain rises on a battle of wits between Sherlock, John and the shadowy stranger who seems to know all the answers...', 'Y', 'N', 9.1),
	('Sherlock', 'A Scandal In Belgravia', 2, 1, 'Yes', 'Yes', 'Yes', 1, 1, 2012, 'Compromising photographs and a case of blackmail threaten the very heart of the British establishment, but for Sherlock and John the game is on in more ways than one as they find themselves battling international terrorism, rogue CIA agents, and a secret conspiracy involving the British government. This case will cast a darker shadow over their lives than they could ever imagine, as the great detective begins a long duel of wits with an antagonist as cold and ruthless and brilliant as himself: to Sherlock Holmes, Irene Adler will always be THE woman.', 'Y', 'N', 9.5),
	('Sherlock', 'The Hounds Of Baskerville', 2, 2, 'Yes', 'Yes', 'Yes', 8, 1, 2012, 'Something terrible has happened to Henry Knight. Sherlock and John investigate the truth about the monstrous creature which apparently killed their client\'s father.A hound from hell? What seems like fantasy in Baker Street is a very different prospect in the ultra-secret army base that looms over Dartmoor.', 'Y', 'N', 8.5),
	('Sherlock', 'The Reichenbach Fall', 2, 3, 'Yes', 'Yes', 'Yes', 15, 1, 2012, 'James Moriarty possesses the greatest criminal mind that the world has ever seen. Sherlock and John knew he wouldn\'t stay hidden for long, but even they never guessed the sheer scale and audacity of the crime that would propel Moriarty back into the headlines.The crime of the century; The Tower of London, the Bank of England and Pentonville prison - all sprung open on the same day, as if by magic! But Moriarty\'s plans don\'t stop there... Sherlock and John lock horns with their old enemy in one final problem that tests loyalty and courage to their very limits. Sherlock must fight for his reputation, his sanity and his life. But is he all he claims to be?', 'Y', 'N', 9.7),
	('Sherlock', 'The Empty Hearse', 3, 1, 'Yes', 'Yes', 'Yes', 1, 1, 2014, 'Two years after the devastating effects of Sherlock\'s \'Death\', Dr John Watson has got on with his life. New horizons, romance and a comforting domestic future beckon. But, with London under threat of a huge terrorist attack, Sherlock Holmes is about to rise from the grave with all the theatricality that comes so naturally to him. Its what his best friend wanted more than anything, but for John Watson it might well be a case of be careful what you wish for! If Sherlock thinks everything will be just as he left it though, hes in for a very big surprise...', 'Y', 'N', 9.1),
	('Sherlock', 'The Sign Of Three', 3, 2, 'Yes', 'Yes', 'Yes', 5, 1, 2014, 'Sherlock faces his biggest challenge of all - delivering a Best Man\'s speech on John\'s wedding day! But all isn\'t quite as it seems. Mortal danger stalks the reception - and someone might not make it to the happy couple\'s first dance. Sherlock must thank the bridesmaids, solve the case and stop a killer!', 'Y', 'N', 9),
	('Sherlock', 'His Last Vow', 3, 3, 'Yes', 'Yes', 'Yes', 12, 1, 2014, 'A case of stolen letters leads Sherlock Holmes into a long conflict with Charles Augustus Magnussen, the Napoleon of blackmail, and the one man he truly hates. But how do you tackle a foe who knows the personal weakness of every person of importance in the Western world?', 'Y', 'N', 9.4),
	('Sherlock', 'The Six Thatchers', 4, 1, 'Yes', 'Yes', 'No', 1, 1, 2017, 'One mysterious case in particular baffles Scotland Yard - but Sherlock is more interested in a seemingly-trivial detail. Why is someone destroying busts of the late Prime Minister Margaret Thatcher? Is there a madman on the loose? Or is there a much darker purpose at work?', 'N', 'N', 7.9),
	('Sherlock', 'The Lying Detective', 4, 2, 'Yes', 'Yes', 'No', 8, 1, 2017, 'Sherlock faces perhaps the most chilling enemy of his long career: the powerful and seemingly unassailable Culverton Smith - a man with a very dark secret indeed.', 'N', 'N', 9.6),
	('Sherlock', 'The Final Problem', 4, 3, 'Yes', 'Yes', 'No', 15, 1, 2017, 'Long buried secrets finally catch up with the Baker Street duo. Someone has been playing a very long game indeed and Sherlock and John Watson face their greatest ever challenge. Is the game finally over?', 'N', 'N', 9.7),
