	('Special Squad', 'Episode-1', 1, 1, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The Special Squad investigates on a murder of an upper middle class girl. She was murdered in a car outside Rock Bottom Pub. The squad assumes it\'s a serial killer case. The victim\'s boyfriend is taken into custody. Fingerprints are found in the car. The victim\'s boss meets the victim before her death. The approximate time of murder is found out. The victim was strangled to death with her own stocking. The squad cracks the case and arrest the murder who is an 18year old friend of the victim.', 'N', 'N', 0),
	('Special Squad', 'Episode-2', 1, 2, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The Special Squad investigates on a murder of a boy who was a trainee of the squad what takes place at a women\'s hostel bathroom. They get information about the victim from the security guard and get to know the time of death via Rigor Mortis. A button is found as evidence. Eye witnesses give their statements. The victim is murdered by dry downing and then dragged into the bathroom. The squad cracks the case and arrest the murder who wanted to take revenge for the ragging been done as a fresher.', 'N', 'N', 0),
	('Special Squad', 'Episode-3', 1, 3, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The squad is checking for clues at the crime site. Shaina enquires about Ravindra from Mr. Gaitonde. Jogi checks the dead body and tries to find out the cause of death. The squad discuss about the clues they got at the crime site. Navin tells the squad about a past incident where Subha catches Ravindra with Riya. Aryan and Shaina enquire from Riya and Subha about Ravindra. The squad gets to know that Ravindra had never been to the US and that Navin is the murderer. Navin confesses his crime.', 'N', 'N', 0),
	('Special Squad', 'Episode-4', 1, 4, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The squad enquires from the public about the incident. Jahangir tells Aryan about the incident. Shaina enquires from Manjul\'s wife who gives them a letter. The squad finds 11 bullets at the crime site. Abbas finds a different bullet shot from some other gun. Ajay gets a tape of the answering machine of Dev\'s call to his wife and get to know that 8 bullets were shot. Shaina is worried for her dad. The squad gets to know that Jahangir is the killer. Jahangir confesses the crime and is arrested.', 'N', 'N', 0),
	('Special Squad', 'Episode-5', 1, 5, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Aryan gets a phone call and is worried. The squad is shocked to find Priya\'s dead body. Zubin is unable to click photos. Ajay tells Ved about Priya\'s death. Ved cries out as he looks at Priya\'s dead body. Neha finds out Virendra\'s finger prints in the garage. Aryan and Shaina enquire from Ved about Virendra\'s case. The squad discuss about the murder from the evidences they have. The squad gets to know that Vinita is Aditi and has murdered Priya to take revenge of her father\'s death.', 'N', 'N', 0),
	('Special Squad', 'Episode-6', 1, 6, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The squad enquires from the watchman. Shaina and Neha question Shobha about Chandrakant. Jogi informs Aryan that Sonali was pregnant. Neha sympathizes for Shobha. Ajay tells Shobha that Sonali was pregnant, to which Shobha tells about Chandrakant\'s operation. Aryan tells Shaina to keep Neha away from the case. Shomiron tells Aryan that the cause of death is due to excess of Viagra. Nikhil tells the squad about the murder incident. Mohan confesses his crime that he has murdered Chandrakant.', 'N', 'N', 0),
	('Special Squad', 'Episode-7', 1, 7, 'Yes', 'Yes', 'NA', 0, 0, 0, 'A couple goes to the forest where they find a dead body of a female. Shaina requests Aryan to come along with her to the court. Aryan informs Ravi about Suchitra\'s murder, to which he says she is yet alive. Dr. Romta tells the squad about Suchitra. Ajay and Abbas tell the squad that Suchitra was in the mental asylum. Aryan interrogates Ravi, to which he says he was at Goa for a holiday. Ravi confesses that he has murdered Suchitra, his first wife.', 'N', 'N', 0),
	('Special Squad', 'Episode-8', 1, 8, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Ajay bangs into a girl as he talks on the phone while he drives the car. The police arrest Ajay. Shaina enquires about Lalita from Manju. Shomiron tells Neha that the tyre marks found on Lalita\'s clothes were of bike. Ved tells Aryan that Lalita suffered from Brain Tumor. Manju tells Shaina about her argument with Lalita. Ved tells Aryan that Lalita\'s death is due to over dose of Pathedene. Manju tells the truth about Lalita and shows the squad Lalita\'s suicide letter. Ajay is proved innocent.', 'N', 'N', 0),
	('Special Squad', 'Episode-9', 1, 9, 'Yes', 'Yes', 'NA', 0, 0, 0, 'A couple\'s dead bodies are found outside a restaurant. The squad interrogates Akhil, who tells about the incident. The squad finds another dead body on the highway. The squad interrogates the driver. Shomiron finds cat hair on Chandan\'s undergarments and Shalini\'s clothes and is suspicious. Ajay and Shaina reach the restaurant for further investigation. Neha shows Aryan the victims phone records. The squad suspects Akhil and he confesses his crime and tells about the incident.', 'N', 'N', 0),
	('Special Squad', 'Episode-10', 1, 10, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The squad argues over the expenses of the forensic team. Jyoti comes to the squad office and confesses that she murdered her husband and narrates the incident. The squad interrogates Jyoti. The squad gets to know about Nirmal\'s 20 lacs insurance. The squad watches Sangeeta console Jyoti, on CCTv. Jyoti commits suicide. The squad gets to know that Nirmal had an affair with Sangeeta. Nirmal tells the truth about the murder and his affair. Nirmal is arrested.', 'N', 'N', 0),
	('Special Squad', 'Episode-11', 1, 11, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The Special Squad investigates the murder of Ashish, member of a renowned business family. Aryan keeps Shaina away from the investigation as he feels her relationship with Mr. Khanna, a loyal employee of the family would hamper the process. But Shaina, in the end, brings out the truth in front of the Special Squad by getting into the detail and finding out that Ashish was murdered by his wife Reena, who is furious at her husband\'s infidelity. She avenges his extramarital affair with a woman named Kavita by poisoning him. Aryan appreciates Shaina for solving the case.', 'N', 'N', 0),
	('Special Squad', 'Episode-12', 1, 12, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Mr. Sen meets Aryan and requests him to investigate who has circulated his daughter Tanya\'s MMS. Neha requests Aryan that she has to go to meet Mohit\'s principle. Tanya informs Shaina and Aryan about her and Jiten\'s relationship. Neha informs that the MMS has been spread to first 6 girls. Neha is angry on Mohit because of his principle\'s complaint. Tanya helps Ajay to prepare sketch of that person who has recorded the clip. Neha makes her own porn video to catch the criminals.', 'N', 'N', 0),
	('Special Squad', 'Episode-13', 1, 13, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Robin a journalist is in comma for making Building Mafia his target. Boxer reaches Robin\'s office for investigation. Nirav Shah tells Ajay that Robin had asked for a 1 bhk flat as bribe. Anti-corruption people blame Boxer for taking bribe. Aryan decides to give justice to Robin. Ajay cheers up Boxer. Robin dies. Booth operator informs the Squad team about a woman who has called Robin. Anti-corruption harasses Abbas by sealing all his bank accounts. Celina confesses her crime. Sqaud arrest Jimmy.', 'N', 'N', 0),
	('Special Squad', 'Episode-14', 1, 14, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The Special Squad investigates on a murder of a house owner. The death body was found in a car. They get information about the victim from the house members. The family member\'s phones are tapped. The squad finds finger prints and a few evidence in the car. The phone calls are traces. The team is frustrated with the case. Victim has been stabbed. The squad cracks the case and the murderer is shot down by Shyla . They also find the kidnaped family members of the victim.', 'N', 'N', 0),
	('Special Squad', 'Episode-15', 1, 15, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Shubroto mother is upset because Cynthia is coming. Watchman tells the squad that Manohar had the habit of sleep walking and the argument between and Sameer and Manohar. Aryan and Boxer investigate Sam\'s room. Cynthia meets Shotgun in office. Sam becomes the prime suspect for his father\'s murder. Cynthia explains Shotgun to settle in Scottland. Sqaud comes to know that Sudhir is a biggest gambler. Shotgun refused to go Scottland. Sudhir confess his crime.', 'N', 'N', 0),
	('Special Squad', 'Episode-16', 1, 16, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The Special Squad is trying to resolve a case of three murders at a dancing academy. The victims are identified as Sudhir, the owner of the academy; Stella, a dancing student; and Mhatre, a stalker. Sudhir\'s partner, Veeru and Sudhir\'s wife, Reeta are interrogated by the Squad. First, it was thought that Sudhir and Mhatre are killed by each other; but with the evidences, it is proven that Stella has a sudden death from a neurogenic shock and Sudhir kills Mhatre by mistaking him to be attacking Stella. Veeru who is having an affair with Reeta, kills Sudhir taking advantage of the situation.', 'N', 'N', 0),
	('Special Squad', 'Episode-17', 1, 17, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Helen informs about Mrs. Fernandes background who was murdered. Squad surprised to find a small baby Justin at Mrs. Fernandes\'s house. Shaina interrogate Maria. Ajay is upset to know that his mother is not coming at his place. Shaina comes to know about Raghu while interrogating Helen. Aryan leaves with his team to investigate a rape case. Ajay arrest Raghu. Father Pereira informs Shaina about rupees 75,000 which make Shaina doubt on Helen. Ramdas brings a new twist to the story.', 'N', 'N', 0),
	('Special Squad', 'Episode-18', 1, 18, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Rashmi is a runner up in a Miss India competition and someone is blackmailing her which brings her to Special Squad for help. Rashmi is shocked to see her home in a mess. Squad team track Rashmi\'s phone calls. Squad finds a dead body at Rashmi\'s house and asks about Anup. Squad team doubts on Anup. During investigation squad team comes to know that criminal has medical knowledge. Shaina\'s father gets heart attack. Rashmi confess that Rahul is her husband. Squad team reaches to detective.', 'N', 'N', 0),
	('Special Squad', 'Episode-19', 1, 19, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Goons break into a moving van. Principle reaches to Special Squad team because his school student Arnav has been kidnapped. Aryan repeatedly gets a threatening call from an unknown person. Squad finds a dead body in forest. Aryan is shicked to know that the kidnappers had not made any ransom call. Baldev Yadav meets Aryan and informs that Gyanendra had exposed some corrupt politicians. Aryan gets frustrated because of political pressure. Squad successfully reaches to the criminal.', 'N', 'N', 0),
	('Special Squad', 'Episode-20', 1, 20, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Encounter officer gets killed during cross firing with narcotics department. Narcotic officer Kapil Verma is admitted in hospital. Squad doubts on Raja on that raja argue with Aryan. Shaina reaches police station to meet Rohit Bakshi but Raja behave rude to her. Aryan suspends Ajay and Boxer from this case. Ajay and Boxer secretly meet Kapil for investigation. Aryan tears police jeep\'s seat cover for investigaton. Raja raise gun on Aryan. Raja threatens Aryan.', 'N', 'N', 0),
	('Special Squad', 'Episode-21', 1, 21, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Watchman Maurya is shot dead at Ahmed Kazi\'s house who is involved in stamp paper scam and squad team reach to investigate. Raja calls Aryan and threatens him. Aryan receives an unknown call who promises him to help him catch his wife and child\'s murderer. Aryan is attacked. Criminal has broken the body rigor to mislead the investigation. Raja conspires to trap Aryan. Aryan couldn\'t find the interrogation tap to prove himself innocent. Someone cheats on Aryan from the Squad.', 'N', 'N', 0),
	('Special Squad', 'Episode-22', 1, 22, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Koynagives birth to a son in M.E.S.hospital but nurse tells her that it was a daughter.Shaina suggests Boxer to investigate this matter secretly. Ajay spies in Patel diagnostic center and seizes some medical documents.Shaina, Ajay, Dr. Ved and Boxer arrive in hospital to investigate the death of Dr. Uday.Shaina and Ajay interrogate Dr. Sundaram about the baby swap case. Shaina questions Dr. Gupta regarding the death of Dr. Uday and Dr. Gupta confesses his involvement in the crime.', 'N', 'N', 0),
	('Special Squad', 'Episode-23', 1, 23, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Shaina questions to Sikha and security guard about the death.Shaina and her team curiously discuss the death case in their office.Shaina interrogates Pawan to know about the death of jasmine.Shaina and Ajay interrogate Raghvesh about the murder case and Raghvesh discloses the name of Khalifa.Shaina and her team interrogate to Khalifa in special squad office to crack the death mystry.Sikha reveals the truth of the murder in front of the special squad.', 'N', 'N', 0),
	('Special Squad', 'Episode-24', 1, 24, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Shaina questions Manish in special squad office in connection with the murder of Samita. Boxer breaks the lock of Yuvraj\'s house to collect evidence.Shaina and Boxer interrogate toYuvraj regarding the death case.Manish and Shaina have a heated argument regarding the murder case of Samita. Shaina reaches at Manish\'s house to know about the death mystery. She records Manish\'s statement secretly. Nita divulges all the details of murder and confesses that she was part of the ploy.', 'N', 'N', 0),
	('Special Squad', 'Episode-25', 1, 25, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The special squad investigate Ritu\'s death. Akram and the Governor\'s son Sudhanshu give their statements. Manprith meets Shaina. The Governor Mr Bhatt reprieves Aryan. Mr. Raja blackmails Ved Shab. Mr Jogi finishes the Autopsy. Ritu\'s mother declares Mr. Verma used Ritu for his Dhamaka Channel\'s sting operations. The video footage is viewed. Manprith is arrested for killing Ritu using Hydrocyanic acid. Ved Shab confesses before his colleagues and gives the tape to Aryan', 'N', 'N', 0),
	('Special Squad', 'Episode-26', 1, 26, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Aryan books a room in Bombay hotel and while verifying the room he found the dead body of Nagesh.Special squad starts investigation of the murder case. Aryan gets entangled with this murder case and he is deeply frustrated due to the development. Aryan makes sketch of the killer.Papaji shows the skin sample to Aryan. Aryan suggests for the DNA test .Daneja and Raja plan to meet in a go down. A shootout occurs between Raja and Aryan and Raja gets killed in that.', 'N', 'N', 0),
	('Special Squad', 'Episode-27', 2, 1, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Deepika joins the special squad as the new chief and she orders to maintain proper record of work. Special squad takes up a new case of a serial killer. Aryan and Shaina visits Neeta Sharma in mental asylum.Shaina and Aryan visit the house of victim to know about the background of the crime. Special squad interrogates Ramesh to know aboutNitin. Special squad arrests and questions Nitin about the murders. Nitin reveals the truth about the murder.', 'N', 'N', 0),
	('Special Squad', 'Episode-28', 2, 2, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Shainameets with Meetali to know about the death of Sonali. Aryan talks with Ravindra about the murder case. Ravindra reveals some important information.Shaina meets with Lalit and informs hims that special squad is reopening the case.Shaina and Ajay enter into Reeta\'s house and collect some evidence.Shaina interrogates Sonali about the murder case.Reeta reveals the truth about the murder. Special squad arrests Lalit from his car. Aryan praises Deepika for her working style.', 'N', 'N', 0),
	('Special Squad', 'Episode-29', 2, 3, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Aryan requests Deepika to give him permission to reopen his family case. Boxer takes permission to investigate the ghost bungalow case. Special squad recovers a mummy from the bungalow.Deepika informs to Aryan that the woman was pregnant when she had died. Shotgun submits the DNA test report of Ajit to Aryan.Deepika finds the clue of broken jaw of the mummy. Special squad interrogates Hema\'s parent.Special squad arrest Vinay and Vinay confesses his guilty.', 'N', 'N', 0),
	('Special Squad', 'Episode-30', 2, 4, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Neha decides to open a 10 year past unsolved rape case. Aryan instructs his team to trace Madhu. Neha succeeds in tracing Madhu\'s whereabouts. Madhu denies co-operating with Shaina. Shaina investigates Rati\'s sister and other rape victims. Madhu reveals some bizarre mannerisms about the culprit. Aryan is rigid on a dry cleaner to be the criminal. Aryan and Shaina catch hold of the corrupt.', 'N', 'N', 0),
	('Special Squad', 'Episode-31', 2, 5, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The special squad team get going on a new case. Shaina interrogates Nandini about the missing person. Shotrughna finds peculiar evidences while examining the dead body. Ajay and Abbas interrogate about Kanhaiya. Ganesh and Nandini\'s DNA do match. Nandini unveils she has adopted Ganesh. Mukesh exposes Kanhaiya\'s evil deeds and confesses his crime.', 'N', 'N', 0),
	('Special Squad', 'Episode-32', 2, 6, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Special squad get their hands on a new case. Shaina interrogates Manisha about her ex-husband DSP Sandeep\'s murder. Shaina and Aryan count Manisha as a prime suspect. Shaina questions Monty about his father\'s lifestyle. Manisha details Sandeep\'s immoral acts. Monty goes missing from child care centre. Shaina secretly sneaks into Deepti\'s room and seizes her and her father. Aryan gets tender on learning Shaina\'s departure.', 'N', 'N', 0),
	('Special Squad', 'Episode-33', 2, 7, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Aryan is astonished on seeing Bomber alive in police custody. Bomber manages to escape from the car. Meanwhile the Special squad have a new case and start their investigation. Bomber repeatedly calls Aryan and threats him. Deepika examines Manoj Sikka\'s body. Aryan insists on saving Shazia. Aryan is restless as he is unable to trace Bomber. Aryan spots Bomber as chases him, but in vain. Bomber succeeds in escaping again.', 'N', 'N', 0),
	('Special Squad', 'Episode-34', 2, 8, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Bomber hints Aryan about his further plans. Aryan assures Shazia\'s safety. Neha studies about Devesh and learns about his past criminal records. Bomber shoots Devesh. Deepika suspects Ajay and Abbas. Aryan arranges a safety house for Shazia. Bomber tells Aryan that he knows his whereabouts. Deepika raids Shazia\'s suitcase and finds a diabetes prescription. Deepika finds real Shazia in a fridge and informs Aryan. Shazia is shot by Aryan. Deepika is stunned to see Bomber in her room.', 'N', 'N', 0),
	('Special Squad', 'Episode-35', 2, 9, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Bomber kidnaps Deepika and informs Aryan. Aryan and team get going to trace Bomber and Deepika. Deepika gives Aryan a clue about her location in Bengali. Bomber demands Swiss bank card in return of Deepika. Aryan discovers a trace card in his own cell phone. Deepika clues Aryan about her whereabouts. Aryan suspects Deepika to be in a deity idols factory. Aryan and team manage to save Deepika. Bomber disguises as a security guard in the special squad office.', 'N', 'N', 0),
	('Special Squad', 'Episode-36', 2, 10, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Bomber hacks and erases all hard disks data from special squad office. Aryan blasts his special squad members for their recklessness. Bomber updates Aryan that he has planted five bombs. Aryan examines Bomber\'s shirt and hair traces on them. Bomber places a bomb in a school girl\'s bag. Aryan entertains children to divert their minds. Aryan helplessly agrees to Bomber\'s terms. Aryan shoots Bomber dead. Aryan and team thrive in defusing all the bombs.', 'N', 'N', 0),
	('Special Squad', 'Episode-37', 2, 11, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Commissioner asks Aryan to hand over his powers to Deepika. Team head starts with a drugs overdose case. Smita finds her husband\'s dead body due to drug overdose. Aryan is hit hard on his head by an unknown person. Aryan finds Nayantara\'s corpse in the toilet. Aryan interrogates Nayantara\'s family. Deepika learns that sweaters contain heroin. Aryan and team catch hold of the culprit.', 'N', 'N', 0),
	('Special Squad', 'Episode-38', 2, 12, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Aryan along with the squad team investigates the accident spot where Suraj is hit by a car. Deepika finds that Suraj died because of asthma attack. Suraj\'s parents informs about Suraj being a mute. It is known that the victim was carrying kavita\'s bag. Arjun informs about Kavita being kidnapped. Aryan asks Manish to purposely collide with the kidnapper\'s car. The squad releases Kavita from kidnaper and also finds that Suraj saw her getting kidnapped and so he was running behind the car when he met with accident.', 'N', 'N', 0),
	('Special Squad', 'Episode-39', 2, 13, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Vijay informs Aryan that his mother Sushma who is found dead had cancer. Aryan doubts Vijay being behind Sushma\'s death. Neha informs Aryan about another cancer patient, Mohit being murdered. Investigation reveals that both the victims along with 4 others died due to the intake of potassium chloride. Aryan and Deepika questions Dr Acharya but later are shocked to know about his death. Aryan finds the person behind the serial killing is Dr Mrs. Acharya.', 'N', 'N', 0),
	('Special Squad', 'Episode-40', 2, 14, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Neha is worried to see Ajay all bruised. Ramdas, with whom Ajay had a small fight is found dead. Aryan and Boxer are shocked to hear Ajay\'s voicemail on Ramdas\'s phone. Aryan and Deepika investigates Ajay. The squad investigates about Ramdas and are shocked to see Ajay\'s intimate pictures with Gitanjali. Ajay reveals that Gitanjali was his girlfriend and Ramdas blackmailed her about the pictures. The squad finds the people behind Ramdas\'s death were four college boys hired by a bank.', 'N', 'N', 0),
	('Special Squad', 'Episode-41', 2, 15, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Manini Ruia is found dead in her car on a deserted spot on the highway. She has been shot at through the glass of the car and the gun is left behind. The details on the mobile phone shows that she had last spoken to a woman called Kartika. Kartika accuses Manini\'s husband, Gaurav, of killing his wife. Aryan and gang rough Gaurav for an alibi and he confesses that he was with his mistress. Another corpse is found near the area and the finger prints on the gun matches with those on the body.', 'N', 'N', 0),
	('Special Squad', 'Episode-42', 2, 16, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Mamta\'s dead body is found floating in the swimming pool at a bunglow on Madh island. The post mortem reveals that the girl had been raped, just hours ago. They investigate and trace that the bungalow was hired by Sudhanshu. They raid the place and find the tapes of a rape flick involving the dead girl. Sudhanshu says he used to offer these girls money to pose for the porn flicks and that the rape on tape is staged. Deepika plans a meeting with Aryan and Gang. Neha suggests a dangerous plan.', 'N', 'N', 0),
	('Special Squad', 'Episode-43', 2, 17, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Saloni is found dead in the bath tub of her house. The special squad agents speak with Saloni\'s sister koyal. She found the dead body first. Koyal blames Neeraj, for the crime as he was a loser and her sister and Neeraj often had fights. They suspect Neeraj, however the people at his office claim him to be a nice guy. Their search also leads to a sea side resort where Neeraj is holed up, drunk out of his wits and he has an interesting story to tell. What is it? And who is the killer?', 'N', 'N', 0),
	('Special Squad', 'Episode-44', 2, 18, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Special Squad gets a call about a bomb blast in a train leaving a Mumbai station. A young boy leaves a bag and runs. Aryan, Boxer and Ajay follow the boy, but in vain. The boy gets shot by the special squad. The bag left behind by the boy contains only illegal pornography CD\'s. The local corporator and the boy\'s parents accuse the Special Squad of police excess in the death of the boy. The bullet that killed the boy does not match any bullet fired by the Squad members. Will Aryan manage to find the actual killer?', 'N', 'N', 0),
	('Special Squad', 'Episode-45', 2, 19, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The body of Safina, a dedicated social worker, is found at a brick kiln run by an NGO. She has been brutally murdered. Mohnish was an HIV positive patient who had come to Safina for counseling. He had been thrown out of his job on some flimsy grounds and he felt that it was because she has leaked the fact that he was HIV positive to his employer. He had been very upset and had threatened her. So looks like Mohnish is the prime suspect. Aryan and Deepika feel that he is being made the scapegoat.', 'N', 'N', 0),
	('Special Squad', 'Episode-46', 2, 20, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Aryan and Deepika finds that the unidentified body, hanged in forest, is of Abhishek, who owns a shop. The team investigates the shop thoroughly. Evidences lead them to Dr. Pratik and finds that his wife is kidnapped. Kidnappers want Dr. Pratik to kill the Chief Minister, whom he is operating, if he wants his wife back. The kidnapper, Ragavesh, who suffered a mental trauma due to his son\'s death, is nabbed by the team. Pratik\'s wife is escorted by the squad.', 'N', 'N', 0),
	('Special Squad', 'Episode-47', 2, 21, 'Yes', 'Yes', 'NA', 0, 0, 0, 'On the marriage night, the newly wedded couples are murdered. The squad investigates their murder. Family reveals an old rivalry with Baktavar Chauhan. The Squad interrogates Baktavar, and check marriage video in which they find vital leads. Aryan gets life threatening calls. Squad finds Ojas\'s dead body, who is close buddy of the groom. In the flow of investigation, they nab the murderers. Ultimately it was Digvijay Singh, who wanted to kill Ojas since he was spoofing on his illegal activities.', 'N', 'N', 0),
	('Special Squad', 'Episode-48', 2, 22, 'Yes', 'Yes', 'NA', 0, 0, 0, 'Navya, who has come to identify a dead body on the basis of a News article, is shot dead in a morgue. Squad investigates her past, and reaches her husband Ayush who was in jail due to his practice of organ smuggling. They doubt Ayush on basis of tattoo. Her lawyer, Vivek is interrogated. The reporter of News article is goes missing. Connecting the anecdotes, Squad nabs Vivek and Ayush behind Navya\'s murder. The reporter reveals the truth to the squad.', 'N', 'N', 0),
	('Special Squad', 'Episode-49', 2, 23, 'Yes', 'Yes', 'NA', 0, 0, 0, 'A man driving towards Pune is pushed off the road and shot. The Special Squad takes up the case and moves the man to the hospital. Their investigation reveals that the dead man, Parag, had just been released from jail a few days back. He had been serving time for a few years for some economic offence. The Squad construes that the attempt to kill could be some old rivalry. However, Parag comes to in the hospital and before dying manages to say that he had seen the killer somewhere before.', 'N', 'N', 0),
	('Special Squad', 'Episode-50', 2, 24, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The Special Squad catches a contract killer who has been hired to kill Mohinder, a major player in the Indian cricket team. The team tries hard to alert Mohinder, but he refuses to believe them. Aryan asks Boxer to be with Mohinder all time. Further investigations reveal the hands of a famous bookie DK. There is no way of nabbing him as he operates from South Africa. Situations turn worse when Mohinder is attacked twice. They will have to find the people who want Mohinder dead, Will they?', 'N', 'N', 0),
	('Special Squad', 'Episode-51', 2, 25, 'Yes', 'Yes', 'NA', 0, 0, 0, 'A cop at a small town brings a witness to Mumbai to testify against Kartoos Anna, a big-time arms supplier. But then their jeep is ambushed and the witness Ganesh, survives and escapes but the cop is gravely injured. Aryan is summoned and asked to help in finding Ganesh. The squad leaves for the small town of Mangeshwadi. The police enquire about Ganesh. Ganesh informs about a proof against in Rajapur. Sushma comes to meet Ganesh. Sushma insists on going with Ganesh and the squad to Rajapur.', 'N', 'N', 0),
	('Special Squad', 'Episode-52', 2, 26, 'Yes', 'Yes', 'NA', 0, 0, 0, 'The squad stops at a villa, due to leakage in fuel tank. The goons attack the squad. Ganesh and the squad walk through the forest to Rajapur. Sushma gets tired and decides to wait in the forest. Aryan finds a photo, and gets upset. Sushma is missing. Neha\'s laptop is missing. Ganesh escapes again. The squad gets to know that Sushma is only Anna Kartoos. Sushma kidnaps Deepika. Aryan shoots Sushma and saves Deepika. Aryan is shot and recalls the past and dies.', 'N', 'N', 0),
	('Sports Night', 'Pilot', 1, 1, 'Yes', 'Yes', 'Yes', 22, 9, 1998, 'Casey begins to slow down at the job, due to his impending divorce. The staff tries to get him out of his haze and J.J. and the network brass threaten to fire him. At the same time Casey himself thinks about leaving until he witnesses that he\'d only do this for the wrong reasons. Dana hires a new associate producer, neurotic, but brilliant Jeremy Goodwin. Dan has a New York Renaissance....', 'Y', 'N', 7.8),
	('Sports Night', 'The Apology', 1, 2, 'Yes', 'Yes', 'Yes', 29, 9, 1998, 'Dan is misunderstood on his opinion over marijuana and the law. When Luther Sachs reads this, he demands an on-air apology; Isaac seconds it, as does Dana. But no one will answer as to whom he should be apologizing to. Casey worries about why he is not considered \'cool\' like Dan is. Dan is stalked by one of the CSC fitness show stars.', 'Y', 'N', 8.4),
	('Sports Night', 'The Hungry And The Hunted', 1, 3, 'Yes', 'Yes', 'Yes', 6, 10, 1998, 'Jeremy gets the \'call\' from Isaac and Dana, to go out on assignment for CSC\'s hunting show. While he wants to move up, he has a problem with hunting animals. Natalie tries to orchestrate romance between Casey and Dana, during one of Luther Sach\'s parties. Technical errors occur on the set.', 'Y', 'N', 7.8),
	('Sports Night', 'Intellectual Property', 1, 4, 'Yes', 'Yes', 'Yes', 13, 10, 1998, 'Casey spins out of control, due to jealousy when Dana starts seriously dating Gordon. He swats flies that no one else can see, kicks fire hydrants and other odd behavior. Dana, Natalie, and Jeremy wonder where all their \'good\' ideas went and CSC has to pay royalties after Dan sings Casey \'Happy Birthday\' on the air.', 'Y', 'N', 7.9),
	('Sports Night', 'Mary Pat Shelby', 1, 5, 'Yes', 'Yes', 'Yes', 20, 10, 1998, 'Dana is excited to be getting a notorious football player, Christian Patrick on the show. The staff is not when his lawyers force them to not mention the ex-girlfriend he badly abused, Mary Pat Shelby. When Natalie goes to pre interview him, he assaults her. Dana\'s decision about whether to break the story is a difficult one, and it is not the same as Dan and Casey\'s. Also Dan wrestles with whether or not to get a goatee and Dana realizes her absence of a sense of humor.', 'Y', 'N', 8.2),
	('Sports Night', 'The Head Coach, Dinner And The Morning Mail', 1, 6, 'Yes', 'Yes', 'Yes', 27, 10, 1998, 'This episodes title represents it three main themes. \'The Head Coach\' involves Dan\'s harsh treatment on a coach\'s bad decision. \'The Diner\' is about Jeremy\'s major decision about where to take Natalie on their first date. And the morning mail is about the hate mail Natalie receives after the events of last week\'s episode.', 'Y', 'N', 8.1),
	('Sports Night', 'Dear Louise', 1, 7, 'Yes', 'Yes', 'Yes', 10, 11, 1998, 'Jeremy writes a letter to his deaf sister about his new job at Sports Night. In it he describes the last few days there, including Dan\'s writer\'s block and the beating of an 80-year-old Negro League ball player, Archibald Russell. He also talks about his love for Natalie. Isaac\'s mad that his daughter is dating a Republican and Casey tries to annoy Gordon, Dana\'s new man.', 'Y', 'N', 8.2),
	('Sports Night', 'Thespis', 1, 8, 'Yes', 'Yes', 'Yes', 17, 11, 1998, 'November 23rd marks the birthday of Thespis, the Greek God of Theater. A legend states that on his birthday he has been known to haunt live productions, and for the first half-hour of it, Sports Night is targeted. This date also is the anniversary of Dan and Casey\'s first broadcast, and Casey can\'t remember. Issac worries over his expecting daughter, and Dana worries about making Thanksgiving for her mother.', 'Y', 'N', 8.2),
	('Sports Night', 'The Quality Of Mercy At 29K', 1, 9, 'Yes', 'Yes', 'Yes', 1, 12, 1999, 'The team broadcasts an Everest climb, the first one since 1954. Jeremy realizes he\'s got something to live for, Natalie. Casey searches for food, as Dan searches for a charity to give to. Dana takes her niece to see \'The Lion King\', and discovers a love of the theater.', 'Y', 'N', 8),
	('Sports Night', 'Shoe Money Tonight', 1, 10, 'Yes', 'Yes', 'Yes', 8, 12, 1999, 'It\'s snowing in Pittsburgh so, the anchors of the 2 AM West Coast Update are stuck and the staff have to stay to do the show. Instead of going to Atlantic City, Dan and Casey and the staff have a poker tournament. Natalie is angry with Jeremy because he skipped an outing with her to go play tennis with an old girlfriend who is now an actress. Casey approves a rundown from the 2AM producer, Sally without consulting Dana, making her feel very angry and unappreciated. Isaac is shrinking.', 'Y', 'N', 8.3),
	('Sports Night', 'The Six Southern Gentlemen Of Tennessee', 1, 11, 'Yes', 'Yes', 'Yes', 15, 12, 1999, 'A southern African American football player and five other students refuse to play at a Tennessee college where the Confederate flag is hung. Luther Sachs the owner of CSC and alumnus of the college sides with the college, but Isaac disagrees and says so on the show. Casey goes on \'The View\' and takes credit for his wardrobe, which he doesn\'t deserve and this leads Dan and another staffer to teach him that the show is a team.', 'Y', 'N', 8.7),
	('Sports Night', 'Smoky', 1, 12, 'Yes', 'Yes', 'Yes', 5, 1, 1999, 'Certain employees try to position themselves for a promotion when rumors of Isaac\'s leaving start to circulate.', 'Y', 'N', 8.2),
	('Sports Night', 'Small Town', 1, 13, 'Yes', 'Yes', 'Yes', 12, 1, 1999, 'It\'s Dana and Casey\'s night off, and neither wants to take it. They decide to double date, Dana with Gordon and Casey with Lisa a lawyer who\'s on a blind date. Natalie is left to produce the show for the first time, and has to handle an 11th hour trade, which in its chaos, Isaac and Jeremy question her authority. Casey\'s replacement is Bobbi Bernstein a psychotic woman who thinks that Dan slept with her in Spain and never called.', 'Y', 'N', 8.2),
	('Sports Night', 'Rebecca', 1, 14, 'Yes', 'Yes', 'Yes', 26, 1, 1999, 'Rumors spread about Isaac\'s job status when the Wall Street Journal reports the recent trouble between Luther Sachs and Sports Night. J.J. begs Isaac to let him forward messages to Luther instead of Isaac doing it himself. This leads Isaac to realize that J.J. is the only one to gain if there is turmoil between the show and company. Maybe J.J. is starting trouble? Dana is nervous that Gordon is going to dump her because she is so preoccupied with work. Dan feels he should apologize for not calling Rebecca after he met her in the elevator. She doesn\'t remember him, though.', 'Y', 'N', 8.4),
	('Sports Night', 'Dana And The Deep Blue Sea', 1, 15, 'Yes', 'Yes', 'Yes', 9, 2, 1999, 'Having been rebuffed by Rebecca, Dan turns to Casey for help in dating her. Casey, still wrestling with his feelings for Dana, refuses. Next Dan turns to Jeremy in his efforts to be \'more than friends\' with Rebecca. Meanwhile, Dana agrees to go snorkeling with Gordon even though she is terrified of fish. Casey: \'Sometimes you just stand there -- hip-deep in pie.\' Rebecca [to Jeremy]: \'Is everyone who works on your show deranged?\'', 'Y', 'N', 8.1),
	('Sports Night', 'Sally', 1, 16, 'Yes', 'Yes', 'Yes', 23, 2, 1999, 'When Casey has a one-night stand and does not tell anyone, the entire staff, led by Dan, prods him for details. After Gordon cancels a date with Dana, she questions the status and future of their relationship. Jewish Jeremy, panics when he is set to visit Natalie\'s parents for a Catholic holiday, he knows nothing of.', 'Y', 'N', 8.2),
	('Sports Night', 'How Are Things In Glocca Morra', 1, 17, 'Yes', 'Yes', 'Yes', 9, 3, 1999, 'A televised tennis match heads into overtime, delaying the start of Sports Night and forcing Dana to choose between canceling a date with Gordon and handing the show over to Sally. Meanwhile, Jeremy uses the delay to write to Louise; and Dan\'s charms are beginning to work on Rebecca.', 'Y', 'N', 8),
	('Sports Night', 'The Sword Of Orion', 1, 18, 'Yes', 'Yes', 'Yes', 23, 3, 1999, 'Hit hard by the news of his parents\' impending divorce, Jeremy pushes himself to solve the mystery of a yachting disaster. This will be his first feature length story. Meanwhile, romance is in the air when Rebecca agrees to watch a baseball game with Dan.', 'Y', 'N', 8.4),
	('Sports Night', 'Eli\'s Coming', 1, 19, 'Yes', 'Yes', 'Yes', 30, 3, 1999, 'Dan\'s day is not shaping up to be a good one as Bobbi Bernstein returns to the broadcast, and he discovers Rebecca\'s husband hasn\'t quite reached \'ex\' status. Meanwhile, Casey and Dana\'s bickering escalates until news that Isaac has suffered a stroke reaches the staff.', 'Y', 'N', 8.5),
	('Sports Night', 'Ordnance Tactics', 1, 20, 'Yes', 'Yes', 'Yes', 6, 4, 1999, 'Isaac\'s in the hospital, the network brass is all over Dana, Jeremy wants to break up with Natalie, Rebecca may go back to her husband and Casey continues to see Sally -- something\'s bound to explode -- let\'s hope it\'s not a bomb in the building!', 'Y', 'N', 7.8),
	('Sports Night', 'Ten Wickets', 1, 21, 'Yes', 'Yes', 'Yes', 13, 4, 1999, 'Jeremy can\'t figure out how to report a great story no-one understands. Natalie doesn\'t accept Jeremy\'s attempts to break up with her. Rebecca gives Dan her decision. Dana starts losing things and Casey doesn\'t want to stop the Jerry Falwell jokes.', 'Y', 'N', 8),
	('Sports Night', 'Napoleon\'s Battle Plan', 1, 22, 'Yes', 'Yes', 'Yes', 27, 4, 1999, 'Gordon has proposed to Dana, and Casey is seething, but tells Dan he plans to \'take the high road\' and follow Napoleon\'s Battle Plan: Show up and see what happens next. Dan reminds Casey that Napoleon lost at Waterloo and died in exile, and announces his intention to \'step in\'. So Dan tells Natalie about Gordon\'s fling with Sally. Natalie runs straight to Dana, who confronts Gordon who, in turn, tells Dana about Casey\'s fling with Sally. Then Dana confronts Sally, who reveals she has been sleeping with Casey for months. Confused? You won\'t be on the tonight\'s episode of . . . oh wait, that\'s another show!', 'Y', 'N', 7.9),
	('Sports Night', 'What Kind Of Day Has It Been', 1, 23, 'Yes', 'Yes', 'Yes', 4, 5, 1999, 'Gordon has an announcement for Dana. Dan helps Casey and his son Charlie with a problem.  Dana has a big new camera and she\'s threatening to use it. Isaac\'s back!', 'Y', 'N', 8.5),
	('Sports Night', 'Special Powers', 2, 1, 'Yes', 'Yes', 'Yes', 5, 10, 1999, 'Isaac returns to the job, but the effects of his stroke appear to be affecting his performance. The 90-day \'cooling off period\'  following Dana\'s canceled wedding is drawing to a close, and Dan encourages Casey to ask Dana out. Natalie and Jeremy fight over a job she\'s offered in Galveston, TX.', 'Y', 'N', 8.2),
	('Sports Night', 'When Something Wicked This Way Comes', 2, 2, 'Yes', 'Yes', 'Yes', 12, 10, 1999, 'Rumors abound that a \'ratings guy\' is being brought in to raise the show from its third place status. To Dana\'s surprise, Isaac announces the rumors are true. Dana has an \'epiphany\' that she and Casey should date other people for six months. Dan is invited to a Hillary Clinton fundraiser, and in his efforts to impress the First Lady, confuses secular with non-secular in a conversation about schools. This causes him no end of distress, and he proceeds to obsess about it to Casey.', 'Y', 'N', 7.7),
	('Sports Night', 'Cliff Gardner', 2, 3, 'Yes', 'Yes', 'Yes', 19, 10, 1999, 'With Sam Donovan around stiffness ensues both on and off the set. Dana debates leaving the show, after she feels everyone is blaming her for the shows problems. Natalie tells her that if she goes she has to bring her, and Jeremy, and Dan, and Casey. The tension grows, when the network bosses demand that the staff meet with J.J. and his boys for some notes. Sam is offered Isaac\'s job but he turns it down, and tells them where to go, thus showing he does have feelings.', 'Y', 'N', 8.3),
	('Sports Night', 'Louise Revisited', 2, 4, 'Yes', 'Yes', 'Yes', 26, 10, 1999, 'Jeremy becomes concerned when he finds out Natalie is writing to his deaf sister Louise. Dan and Casey become, very competitive about an Internet poll, over whose cooler. Casey convinces Jeremy to rig the computer to vote for him 2,000 times a minute. When Dana goes out with an old friend from high school, Cab Calloway, Casey is angry. Dana as a spur of the moment action takes off her underwear during the meal.', 'Y', 'N', 7.6),
	('Sports Night', 'Kafelnikov', 2, 5, 'Yes', 'Yes', 'Yes', 2, 11, 1999, 'Jeremy tells Dana that there is no reason to hire people to prepare for the expected Y2K computer problems; he has made the computers Y2K compatible. To prove this, Jeremy, rigs the computer to say that it is December 31, 1999 and hold a Y2K test to prove that there will be no computer problems when the studio rolls into 2000. The results are total darkness. Dan picks up a therapist in a bar, who invites him out on a date... or does she really just think he needs some therapy?', 'Y', 'N', 7.8),
	('Sports Night', 'Shane', 2, 6, 'Yes', 'Yes', 'Yes', 7, 12, 1999, 'Natalie obsesses over the loss of hell. In a nod to real-life racist John Rocker, Casey interviews an old friend, Shane McArnold, who heaps disdain on his new home city of New York and all its inhabitants. Casey promises to \'fix it\' out of loyalty, but Dana knows it\'s good television and leaves it as is. Meanwhile, Dan\'s therapist Abby is opening up Dan\'s true feelings about his family, making him more and more dysfunctional.', 'Y', 'N', 7.7),
	('Sports Night', 'Kyle Whitaker\'s Got Two Sacks', 2, 7, 'Yes', 'Yes', 'Yes', 14, 12, 1999, 'Dana is extremely proud when her brother gets two sacks in a football game. She becomes determined to show others how he did it. Jeremy is nervous about firing Corbin Davis, a cousin of JJ\'s who is screwing up simple assignments. Jeremy gives him a pep talk and Corbin tells him, that he doesn\'t take sides when JJ talks bad about this show. Because of a drug scandal involving football players erupts, Casey travels to Ohio to find out the names, Tina fills in. When the names are uncovered, one hits close to home for Dana... literally... her brother.', 'Y', 'N', 8.1),
	('Sports Night', 'The Reunion', 2, 8, 'Yes', 'Yes', 'Yes', 21, 12, 1999, 'Dana gets edgy as the arrival of her brother comes close. As part of a Secret Santa, Casey searches for the perfect gift for Isaac. Natalie tells Casey that if his gift isn\'t cheap and located within two blocks of the building he\'s getting socks. When Natalie gives Dan a tape to watch of her work as an anchor, he tells her it was great, when it really was just mediocre. The crew struggles to name an athlete of the century. Dan decides to go to midnight mass, even though he\'s Jewish.', 'Y', 'N', 7.8),
	('Sports Night', 'A Girl Named Pixley', 2, 9, 'Yes', 'Yes', 'Yes', 28, 12, 1999, 'Dana worries when Casey goes out on a date. Jeremy\'s optimism about his award nomination fades.', 'Y', 'N', 7.7),
	('Sports Night', 'The Giants Win The Pennant, The Giants Win The Pennant', 2, 10, 'Yes', 'Yes', 'Yes', 11, 1, 2000, 'Casey goes out with Pixley again much to Dana\'s dismay. Dan wants to do a story on the amazing World Series win by the Giants in 1951, and finds out that Isaac was actually at the game, although he missed the key home run. When Casey finds out Isaac never told him, but told Jeremy he questions their special bond.', 'Y', 'N', 8.1),
	('Sports Night', 'The Cut Man Cometh', 2, 11, 'Yes', 'Yes', 'Yes', 18, 1, 2000, 'While prepping to cover a major fight, Dana and Casey duke it out over their stalled fling, and Dan\'s dad, Jay, hits town for a tense visit. But after the match goes south, the CSC staff bands together to knock out a killer show, including an hour\'s worth of coverage of a fight that lasted under a minute and a correspondent who only will respond to being called \'the cut man\', calls Dan; Casey, and Casey; Dan. He also shows he has no idea what he is talking about, when he talks about the last winner of the Miss America pageant, Miss Rochester.', 'Y', 'N', 8.1),
	('Sports Night', 'The Sweet Smell Of Air', 2, 12, 'Yes', 'Yes', 'Yes', 25, 1, 2000, 'The crew is excited when they get a chance to interview Michael Jordan; that is until the strings began to be attached. First they find a paper in the press packet, that coaches Michael how to steer away from sports questions, next they are told to only talk about his new cologne, and then they get a request for total editorial control to Michael. They drop the interview when they discover that they were picked because of their ratings vulnerability. Sam returns and sets Dana into a frenzy, he later meets Sally. Casey frets over what to do in front of Charlie\'s class, when he is invited to show and tell.', 'Y', 'N', 7.5),
	('Sports Night', 'Dana Get Your Gun', 2, 13, 'Yes', 'Yes', 'Yes', 1, 2, 2000, 'Natalie and Jeremy fight over going to a club. Dan finagles the night off. A substitute anchor can\'t do his job because of his girlfriend. Dana and Sam share a moment.', 'Y', 'N', 7.5),
	('Sports Night', 'And The Crowd Goes Wild', 2, 14, 'Yes', 'Yes', 'Yes', 8, 2, 2000, 'Jeremy and Natalie\'s break-up ripples through the show after Jeremy asks for his \'stuff\' back. Casey\'s dilated pupils provide comic relief for Dan and the crew. Dana deals with Sam\'s imminent departure. A riot breaks out at Madison Square Garden and Natalie questions turning over the show\'s filmed coverage of the event to the police.', 'Y', 'N', 7.2),
	('Sports Night', 'Celebrities', 2, 15, 'Yes', 'Yes', 'Yes', 29, 2, 2000, 'The staff prepares for a game of \'Celebrities\'. Jeremy, feeling left out, goes to the bar and makes a new friend, then panics when he realizes who she is. Isaac, despite his vast knowledge of American popular theatre, cannot recall the lyrics of \'How Are Things In Glocca Morra\'.', 'Y', 'N', 8.1),
	('Sports Night', 'The Local Weather', 2, 16, 'Yes', 'Yes', 'Yes', 7, 3, 2000, 'Dan decides to skip therapy and spends an hour in Abby\'s office telling her so. Jeremy e-mails the porn star he blew off, then decides to tell her in person why he\'s not going to see her again. Casey decides to bribe the gang with international cuisine to get them to watch a track and field event in the wee hours. Dana decides to seek shelter from a rainstorm in church.', 'Y', 'N', 7.8),
	('Sports Night', 'Draft Day - 1 - It Can\'t Rain At Indian Wells', 2, 17, 'Yes', 'Yes', 'Yes', 14, 3, 2000, 'Casey and Dana try to psyche each other out as they prepare to make their NFL draft day predictions. Dan gets glum when his golf date with PGA star David Duval is jeopardized - by his job. Jeremy tells Natalie about Jenny - except for the part about her being a porn star. Casey questions Dan\'s attitude and Dan questions their relationship.', 'Y', 'N', 7.7),
	('Sports Night', 'Draft Day - 2 - The Fall Of Ryan O\'Brian', 2, 18, 'Yes', 'Yes', 'Yes', 21, 3, 2000, 'As NFL draft day unfolds, relationships unravel. Jeremy anguishes over Jenny\'s visit to the studio, where she and Natalie discover common ground and she and Jeremy come apart. After giving him a talking-to behind closed doors, Casey is stunned when Dan humiliates him in front of millions.', 'Y', 'N', 7.8),
	('Sports Night', 'April Is The Cruelest Month', 2, 19, 'Yes', 'Yes', 'Yes', 28, 3, 2000, 'The network deals a financial blow to \'Sports Night\' that has Isaac and Dana reeling - the show\'s Olympic coverage is going to be cut to the quick and Natalie\'s job may be cut entirely! Depressed about his disgraceful on-air behavior toward Casey, Dan decides to hold a Passover Seder, which Jeremy turns into a theatrical event that has a healing effect on everyone.', 'Y', 'N', 7.9),
	('Sports Night', 'Bells And A Siren', 2, 20, 'Yes', 'Yes', 'Yes', 4, 4, 2000, 'Upset when Natalie gets a job interview with Saturday Night Live, Dana encourages everyone to undermine her confidence. Dan\'s publicist wants him on the PR fast track - starting with an appearance in New Jersey! Casey and Jeremy roll up their sleeves and try to get to the bottom of CSC\'s financial woes. Isaac stresses over his stroke\'s effect on his grandson.', 'Y', 'N', 7.6),
	('Sports Night', 'La Forza Del Destino', 2, 21, 'Yes', 'Yes', 'Yes', 9, 5, 2000, 'While at Anthony\'s trying to drown their fears about the future of \'Sports Night\', Dana meets a mysterious stranger who seems to know a great deal about the bidding for Continental Corp.; and Dan tries to convince Casey that a move to LA might not be a bad thing.', 'Y', 'N', 8),
	('Sports Night', 'Quo Vadimus', 2, 22, 'Yes', 'Yes', 'Yes', 16, 5, 2000, 'Bidders drop out of the auction for Continental Corp., which causes concern for the future of the \'Sports Night\' team. Meanwhile, Casey prepares to look for new work without Dan, who is reunited with a familiar face from his past.', 'Y', 'N', 8.7),
	('Stranger Things', 'Chapter One - The Vanishing Of Will Byers', 1, 1, 'Yes', 'Yes', 'Yes', 15, 7, 2016, 'On his way home from a friend\'s house, young Will sees something terrifying. Nearby, a sinister secret lurks in the depths of a government lab.', 'N', 'N', 8.6),
	('Stranger Things', 'Chapter Two - The Weirdo On Maple Street', 1, 2, 'Yes', 'Yes', 'Yes', 15, 7, 2016, 'Lucas, Mike and Dustin try to talk to the girl they found in the woods. Hopper questions an anxious Joyce about an unsettling phone call.', 'N', 'N', 8.5),
	('Stranger Things', 'Chapter Three - Holly, Jolly', 1, 3, 'Yes', 'Yes', 'Yes', 15, 7, 2016, 'An increasingly concerned Nancy looks for Barb and finds out what Jonathan\'s been up to. Joyce is convinced Will is trying to talk to her.', 'N', 'N', 9),
	('Stranger Things', 'Chapter Four - The Body', 1, 4, 'Yes', 'Yes', 'Yes', 15, 7, 2016, 'Refusing to believe Will is dead, Joyce tries to connect with her son. The boys give Eleven a makeover. Nancy and Jonathan form an unlikely alliance.', 'N', 'N', 9),
	('Stranger Things', 'Chapter Five - The Flea And The Acrobat', 1, 5, 'Yes', 'Yes', 'Yes', 15, 7, 2016, 'Hopper breaks into the lab while Nancy and Jonathan confront the force that took Will. The boys ask Mr. Clarke how to travel to another dimension.', 'N', 'N', 8.9),
	('Stranger Things', 'Chapter Six - The Monster', 1, 6, 'Yes', 'Yes', 'Yes', 15, 7, 2016, 'A frantic Jonathan looks for Nancy in the darkness, but Steve\'s looking for her, too. Hopper and Joyce uncover the truth about the lab\'s experiments.', 'N', 'N', 9),
	('Stranger Things', 'Chapter Seven - The Bathtub', 1, 7, 'Yes', 'Yes', 'Yes', 15, 7, 2016, 'Eleven struggles to reach Will, while Lucas warns that \'the bad men are coming\'. Nancy and Jonathan show the police what Jonathan caught on camera.', 'N', 'N', 9.1),
	('Stranger Things', 'Chapter Eight - The Upside Down', 1, 8, 'Yes', 'Yes', 'Yes', 15, 7, 2016, 'Dr. Brenner holds Hopper and Joyce for questioning while the boys wait with Eleven in the gym. Back at Will\'s, Nancy and Jonathan prepare for battle.', 'N', 'N', 9.4),
	('Studio 60 On The Sunset Strip', 'Pilot', 1, 1, 'Yes', 'Yes', 'No', 18, 9, 2006, 'The once great sketch comedy show \'Studio 60\' is suddenly close to cancellation due not only to its less than stellar on-air product, but another, more unexpected type of action, its Executive Producer\'s on-air mental meltdown. So enter NBS Chairman of the board Jack Rudolph and a new network president, looking to put her mark on the struggling network, Jordan McDeere. This results in the re-hiring of Danny Tripp and Matt Albie to replace the former Executive Producer and hopefully save the show.', 'Y', 'N', 8.8),
	('Studio 60 On The Sunset Strip', 'The Cold Open', 1, 2, 'Yes', 'Yes', 'No', 25, 9, 2006, 'Now that they\'re on board, Matt and Danny try not to crumble under the pressure of putting on their first big show, where the stakes are outrageously high. Also high are the number of complaints the network is getting over the \'Crazy Christians\' sketch, which Jordan defends to Jack.', 'Y', 'N', 8.8),
	('Studio 60 On The Sunset Strip', 'The Focus Group', 1, 3, 'Yes', 'Yes', 'No', 2, 10, 2006, 'A scare is sent through the company by a focus group that Matt and Danny\'s first show rating success might not carry on during the rest of the season.', 'Y', 'N', 8.4),
	('Studio 60 On The Sunset Strip', 'The West Coast Delay', 1, 4, 'Yes', 'Yes', 'No', 9, 10, 2006, 'Matt fabricates a response to a gift sent by one of Harriet\'s fans while the show attempts to recover from 90 seconds of questionable material. An article about the show is approved by Jordan.', 'Y', 'N', 8.7),
	('Studio 60 On The Sunset Strip', 'The Long Lead Story', 1, 5, 'Yes', 'Yes', 'No', 16, 10, 2006, 'During cast rehearsals with Lauren Graham and Sting, a reporter attempts to get the real story on Matt and Harriet. Meanwhile Jordan passes on a tasteless new reality series.', 'Y', 'N', 8.2),
	('Studio 60 On The Sunset Strip', 'The Wrap Party', 1, 6, 'Yes', 'Yes', 'No', 23, 10, 2006, 'A drunken Jordan makes friends with the cast during an after-show party, Danny tries to get Matt\'s mind off Harriet with the help of three sexy women, Simon  makes a plea to hire more black writers and Cal deals with a mysterious man backstage (guest star Eli Wallach).', 'Y', 'N', 8.5),
	('Studio 60 On The Sunset Strip', 'Nevada Day - 1', 1, 7, 'Yes', 'Yes', 'No', 6, 11, 2006, 'Studio 60 staff must travel to Nevada to free Tom from jail in time for the show. Meanwhile, a judge who doesn\'t care for the show complicates matters.', 'Y', 'N', 8.7),
	('Studio 60 On The Sunset Strip', 'Nevada Day - 2', 1, 8, 'Yes', 'Yes', 'No', 13, 11, 2006, 'Jack pleads with the local Nevada judge (John Goodman) to free Tom so he can make it back to the Friday night show. Meanwhile, tension heats up between Matt and Harriet on the set.', 'Y', 'N', 8.5),
	('Studio 60 On The Sunset Strip', 'The Option Period', 1, 9, 'Yes', 'Yes', 'No', 20, 11, 2006, 'Word of Ricky and Ron planning to leave the show along with the writing staff causes trouble at Studio 60. Meanwhile, Harriet considers doing a sexy lingerie spread in a magazine and Jordan and Danny wrestle with pending budget cuts.', 'Y', 'N', 8.3),
	('Studio 60 On The Sunset Strip', 'B-12', 1, 10, 'Yes', 'Yes', 'No', 27, 11, 2006, 'A virus threatens the staff while Matt has to cope with a reduced writing staff. Jordan tells Danny a little secret which could affect the whole NBS network.', 'Y', 'N', 8.5),
	('Studio 60 On The Sunset Strip', 'The Christmas Show', 1, 11, 'Yes', 'Yes', 'No', 4, 12, 2006, 'With a holiday show on the horizon, Matt is determined to bring the Christmas spirit to Studio 60. Which works romantic wonders for him. Meanwhile, Danny has to confront his true feelings for Jordan.', 'Y', 'N', 9),
	('Studio 60 On The Sunset Strip', 'Monday', 1, 12, 'Yes', 'Yes', 'No', 22, 1, 2007, 'Danny continues his pursuit of Jordan while Matt competes on an online bid for a date with Harriet. Jack and Wilson must deal with their pending situation about Macau, while Jordan meets with Hallie Gallway regarding a new reality show pitch.', 'Y', 'N', 8.3),
	('Studio 60 On The Sunset Strip', 'The Harriet Dinner - 1', 1, 13, 'Yes', 'Yes', 'No', 29, 1, 2007, 'Danny and Jordan cannot get down from the roof of the theater, staff members attend a dinner honoring Harriet. Harriet and Matt\'s relationship begins to unravel.', 'Y', 'N', 8.3),
	('Studio 60 On The Sunset Strip', 'The Harriet Dinner - 2', 1, 14, 'Yes', 'Yes', 'No', 5, 2, 2007, 'Danny and Jordan cannot get down from the roof of the theater, staff members attend a dinner honoring Harriet. Harriet and Matt\'s relationship begins to unravel.', 'Y', 'N', 8.4),
	('Studio 60 On The Sunset Strip', 'The Friday Night Slaughter', 1, 15, 'Yes', 'Yes', 'No', 12, 2, 2007, 'Matt takes a stroll down memory lane and recalls how he met Harriet', 'Y', 'N', 8.3),
	('Studio 60 On The Sunset Strip', '4 A.M. Miracle', 1, 16, 'Yes', 'Yes', 'No', 19, 2, 2007, 'Matt is stuck on a Wednesday night with writer\'s block and also has to contend with a young lawyer who\'s investigating a sexual harassment claim while Harriet continues shooting her movie. In addition, Jordan and Danny enter into a contest to see who\'d make the better parent.', 'Y', 'N', 8.4),
	('Studio 60 On The Sunset Strip', 'The Disaster Show', 1, 17, 'Yes', 'Yes', 'No', 24, 5, 2007, 'Allison Janney, as herself, is the guest host of a show that goes haywire when the propmasters and cue card workers stage a last minute wildcat strike.', 'Y', 'N', 8.2),
	('Studio 60 On The Sunset Strip', 'Breaking News', 1, 18, 'Yes', 'Yes', 'No', 31, 5, 2007, 'During a live show, Jordan has problems with her pregnancy while an even bigger problem is in store for Tom. Meanwhile, Matt\'s rampant pill use is discovered by a member of staff.', 'Y', 'N', 8.5),
	('Studio 60 On The Sunset Strip', 'K & R - 1', 1, 19, 'Yes', 'Yes', 'No', 7, 6, 2007, 'Jordan is rushed into surgery as the situation with Tom\'s brother grows more grim.', 'Y', 'N', 8.4),
	('Studio 60 On The Sunset Strip', 'K & R - 2', 1, 20, 'Yes', 'Yes', 'No', 14, 6, 2007, 'Tom\'s Brother is still captive. Simon talks to the press, the lawyer talks to the ransom liaisons. Matt flashes back to 9/11 censorship. Jordan has her baby.', 'Y', 'N', 8.3),
	('Studio 60 On The Sunset Strip', 'K & R - 3', 1, 21, 'Yes', 'Yes', 'No', 21, 6, 2007, 'The long day\'s journey into night continues as we learn more, in flashback, about how Matt and Danny came to be fired. Jack tries to convince Simon to apologize for his statement to the press. Matt continues to explore paying a ransom to free Toms brother over the objections of Captain Boyle. Harriet sits with and act as a distraction for Danny who is keeping vigil for Jordan at the hospital.', 'Y', 'N', 8.4),
	('Studio 60 On The Sunset Strip', 'What Kind Of Day Has It Been', 1, 22, 'Yes', 'Yes', 'No', 28, 6, 2007, 'Danny, Jordan, Tom, and Simon\'s long day finally comes to an end. Meanwhile, Matt and Harriet have a new start in their relationship.', 'Y', 'N', 8.9),
	('Supergirl', 'Pilot', 1, 1, 'Yes', 'Yes', 'Yes', 26, 10, 2015, 'Kara at age 12 was sent from her dying home planet of Krypton to Earth, where she was taken in by the Danvers, a foster family who taught her to be careful with her extraordinary powers. After repressing said skills for more than a decade, Kara is forced to bust out her super moves in public during an unexpected disaster. Energized by her heroism for the first time in her life, she begins embracing her abilities in the name of helping the people of her city, earning herself a super moniker along the way.', 'Y', 'N', 7.2),
	('Supergirl', 'Stronger Together', 1, 2, 'Yes', 'Yes', 'Yes', 2, 11, 2015, 'When Kara\'s attempts to help National City don\'t go according to plan, she must put aside the doubts that she -- and the city\'s media -- has about her abilities in order to capture an escapee from the Kryptonian prison, Fort Rozz. Also, Cat pressures James to use his connection to Superman to get her an interview with Supergirl.', 'Y', 'N', 7.4),
	('Supergirl', 'Fight Or Flight', 1, 3, 'Yes', 'Yes', 'Yes', 9, 11, 2015, 'Supergirl\'s powers are tested when Reactron, one of Superman\'s formidable enemies, arrives in National City and targets the young hero. Also, Cat plans to run an expos on Supergirl.', 'Y', 'N', 7.5),
	('Supergirl', 'Livewire', 1, 4, 'Yes', 'Yes', 'Yes', 16, 11, 2015, 'Kara\'s Thanksgiving may be ruined when she suspects her foster mother, Dr. Danvers, who is coming to town, disapproves of her new role as a superhero. Also, when an accident transforms a volatile CatCo employee into the villainous Livewire, she targets Cat and Supergirl.', 'Y', 'N', 7.7),
	('Supergirl', 'How Does She Do It', 1, 5, 'Yes', 'Yes', 'Yes', 23, 11, 2015, 'Kara\'s two identities are stretched thin when Supergirl must protect National City from a series of bombings and Kara is tasked with babysitting Cat\'s son, Carter. Also, James is conflicted when his ex-girlfriend Lucy Lane seeks to rekindle their relationship.', 'Y', 'N', 7.7),
	('Supergirl', 'Red Faced', 1, 6, 'Yes', 'Yes', 'Yes', 30, 11, 2015, 'Personal and professional stress get the better of Kara when she goes too far during a training exercise against Red Tornado, a military cyborg commissioned by Lucy Lane\'s father, General Sam Lane. Also, Cat\'s tough exterior is shaken by a visit from her judgmental mother, Katherine, and Alex enlists Winn to look into her father\'s mysterious death.', 'Y', 'N', 8),
	('Supergirl', 'Human For A Day', 1, 7, 'Yes', 'Yes', 'Yes', 7, 12, 2015, 'Kara and her friends must rely on their inner strength and courage when an earthquake strikes National City. Also, Alex\'s mistrust of Hank reaches a breaking point when the earthquake traps them in the DEO with Jemm, a powerful alien escapee.', 'Y', 'N', 8.3),
	('Supergirl', 'Hostile Takeover', 1, 8, 'Yes', 'Yes', 'Yes', 14, 12, 2015, 'Kara goes toe-to-toe with Astra when her aunt challenges Kara\'s beliefs about her mother. Also, Cat is threatened with being removed as the CEO of CatCo after a hacker exposes her private and damaging emails.', 'Y', 'N', 8.4),
	('Supergirl', 'Blood Bonds', 1, 9, 'Yes', 'Yes', 'Yes', 4, 1, 2016, 'With Astra in captivity at the DEO, her husband, Non, captures Hank, leading to a tense standoff between the two sides. Also, Kara continues to refute Cat\'s allegations that she is Supergirl.', 'Y', 'N', 8.1),
	('Supergirl', 'Childish Things', 1, 10, 'Yes', 'Yes', 'Yes', 18, 1, 2016, 'Kara does her best to support Winn when his father, the supervillain Toyman, breaks out of prison and seeks out his son for unknown reasons. Also, Cat offers Lucy a job at CatCo and Alex asks Hank to use his powers to help uncover Maxwell Lord\'s plans.', 'Y', 'N', 8.1),
	('Supergirl', 'Strange Visitor From Another Planet', 1, 11, 'Yes', 'Yes', 'Yes', 25, 1, 2016, 'Kara must help Hank face his painful past when a White Martian, a member of the alien race that wiped out his people, kidnaps Senator Miranda Crane, an anti-alien politician. Also, Cat\'s estranged son, Adam, arrives in National City.', 'Y', 'N', 8.4),
	('Supergirl', 'Bizarro', 1, 12, 'Yes', 'Yes', 'Yes', 1, 2, 2016, 'Kara faces off against her mirror image when Bizarro, a twisted version of Supergirl, sets out to destroy her. Also, Kara grows closer with Cat\'s son, Adam.', 'Y', 'N', 8),
	('Supergirl', 'For The Girl Who Has Everything', 1, 13, 'Yes', 'Yes', 'Yes', 8, 2, 2016, 'Kara\'s friends must find a way to save her life when a parasitic alien attaches itself to her and traps her in a dream world where her family is alive and her home planet was never destroyed. Also, Alex, Hank and the DEO must fend off a Kryptonian attack while Kara is out of commission.', 'Y', 'N', 8.3),
	('Supergirl', 'Truth, Justice And The American Way', 1, 14, 'Yes', 'Yes', 'Yes', 22, 2, 2016, 'Supergirl does battle with the deadly Master Jailer, who is hunting and executing escaped Fort Rozz prisoners. Also, Cat hires a second assistant, Siobhan Smythe, who immediately tries to one-up Kara, and Kara and James disagree over the DEO\'s methods.', 'Y', 'N', 7.9),
	('Supergirl', 'Solitude', 1, 15, 'Yes', 'Yes', 'Yes', 29, 2, 2016, 'Kara travels to Superman\'s Fortress of Solitude in hopes of learning how to defeat Indigo, a dangerous being who can transport via the Internet and who has a connection to Kara\'s past. Also, James\'s relationship with Lucy reaches a crossroads.', 'Y', 'N', 8.2),
	('Supergirl', 'Falling', 1, 16, 'Yes', 'Yes', 'Yes', 14, 3, 2016, 'Kara turns on her friends and the citizens of National City after being exposed to Red Kryptonite makes her malicious and dangerous. Also, Cat appears on THE TALK to discuss Supergirl.', 'Y', 'N', 9.1),
	('Supergirl', 'Manhunter', 1, 17, 'Yes', 'Yes', 'Yes', 21, 3, 2016, 'J\'onn J\'nnzz reveals the details of meeting Kara and Alex\'s father, Dr. Jeremiah Danvers, and assuming Hank Henshaw\'s identity. Also, Kara debates trusting someone new with her secret identity and Siobhan plots against Kara.', 'Y', 'N', 8.5),
	('Supergirl', 'Worlds Finest', 1, 18, 'Yes', 'Yes', 'Yes', 28, 3, 2016, 'Kara gains a new ally when the lightning-fast superhero The Flash suddenly appears from an alternate universe and helps Kara battle Siobhan, aka Silver Banshee, and Livewire in exchange for her help in finding a way to return him home.', 'Y', 'N', 9),
	('Supergirl', 'Myriad', 1, 19, 'Yes', 'Yes', 'Yes', 11, 4, 2016, 'Kara must find a way to free her friends when Non and Indigo use mind control to turn National City\'s citizens into their own army.', 'Y', 'N', 8.1),
	('Supergirl', 'Better Angels', 1, 20, 'Yes', 'Yes', 'Yes', 18, 4, 2016, 'Supergirl is forced to do battle with an unexpected foe and must risk everything including her life to prevent Non and Indigo from destroying every person on the planet.', 'Y', 'N', 8.3),
	('Supergirl', 'The Adventures Of Supergirl', 2, 1, 'Yes', 'Yes', 'No', 10, 10, 2016, 'When a new threat emerges in National City, Kara/Supergirl teams up with her cousin, Clark Kent/Superman, to stop it. Kara is thrilled to have family in town but it leaves Alex feeling a bit left out. Meanwhile, Hank and Supergirl are stunned by the pod that came crashing to Earth.', 'N', 'N', 8.6),
	('Supergirl', 'The Last Children Of Krypton', 2, 2, 'Yes', 'Yes', 'No', 17, 10, 2016, 'CADMUS attacks National City with a Kryptonite-powered villain who ends up seriously hurting Supergirl. Superman blames Hank because the Kryptonite was stolen from the DEO. Meanwhile, Karas first day at her new job doesnt go as planned after she meets her new boss, Snapper Carr.', 'N', 'N', 8.5),
	('Supergirl', 'Welcome To Earth', 2, 3, 'Yes', 'Yes', 'No', 24, 10, 2016, 'An attack is made on the President as hot-button, alien vs. human rights issues heat up in National City. Supergirl and the DEO are assigned to protect the President and bring in the responsible party. Alex teams up with Detective Maggie Sawyer to investigate the case while Kara searches for a recently escaped Mon-El, who she fears may be the alien behind the assault.', 'N', 'N', 8.2),
	('Supergirl', 'Survivors', 2, 4, 'Yes', 'Yes', 'No', 31, 10, 2016, 'When Kara and Alex investigate the murder of an unregistered alien, the trail leads to an alien fight club run by Roulette, the ringmaster who commands aliens to fight in mortal combat for the entertainment of rich humans. While trying to stop the fighting, Supergirl and Martian Manhunter find themselves up against a surprising opponent. Meanwhile, Hank is thrilled to have found another Martian and tries to get to know M\'Gann better. Supergirl takes Mon-El under her wing and begins to train him.', 'N', 'N', 8.1),
	('Supergirl', 'Crossfire', 2, 5, 'Yes', 'Yes', 'No', 7, 11, 2016, 'Supergirl must beat a ruthless new gang who has been armed with dangerous new alien technology. When Cadmus sends a video to the DEO, the team realizes Cadmus is the one staffing the criminals for a secret mission. Meanwhile, Kara gets Mon-El a job as an intern at CatCo, James makes an important decision and Lena invites Kara to attend one her fundraisers.', 'N', 'N', 8),
	('Supergirl', 'Changing', 2, 6, 'Yes', 'Yes', 'No', 14, 11, 2016, 'The Guardian debuts to lend a hand after a parasite alien drains Supergirl of her power. Mon-El considers a less than desirable new career which then leads him to contemplate his motives. Alex struggles with a new reality.', 'N', 'N', 8.2),
	('Supergirl', 'The Darkest Place', 2, 7, 'Yes', 'Yes', 'No', 21, 11, 2016, 'While Guardian tries to clear his name after being accused of a murder committed by another vigilante, Supergirl heads out on a solo mission to rescue Mon-El who has been captured by CADMUS. While fighting to free Mon-El, Supergirl comes face to face with Cyborg Superman.', 'N', 'N', 8.2),
	('Supergirl', 'Medusa', 2, 8, 'Yes', 'Yes', 'No', 28, 11, 2016, 'Eliza comes to town to celebrate Thanksgiving with her daughters. Alex decides its time to come out to her mother; Kara is shocked when Eliza suggests Mon-El has feelings for her, and Winn and James consider telling Kara the truth about the Guardian. Meanwhile, CADMUS unleashes a virus that instantly kills any alien in the vicinity so Kara enlists an unexpected ally  Lena Luthor. The epic superhero crossover kicks off tonight when Barry Allen and Cisco Ramon seek Karas help with an alien invasion on their Earth.', 'N', 'N', 8.3),
	('Supergirl', 'Supergirl Lives', 2, 9, 'Yes', 'Yes', 'No', 23, 1, 2017, 'When Kara investigates the story of a missing woman, she and Mon-El end up being thrust through a portal to another planet where the downtrodden are sold as slaves.', 'N', 'N', 8),
	('Supergirl', 'We Can Be Heroes', 2, 10, 'Yes', 'Yes', 'No', 30, 1, 2017, 'After Livewire seemingly breaks out of prison, Supergirl is intent on recapturing her. After training Mon-El, Supergirl takes him with her when she sees Livewire attack the NCPD but things go awry when Mon-El puts Supergirl before the citizens of National City. Meanwhile, James decides to come clean with Kara and MGann, has a psychic attack, and collapses into a coma.', 'N', 'N', 7.7),
	('Supergirl', 'The Martian Chronicles', 2, 11, 'Yes', 'Yes', 'No', 6, 2, 2017, 'Armek, a White Martian, descends on National City intent on taking Mgann back to Mars to face her punishment as a traitor. Hank and Supergirl determine the best way to keep Mgann safe is to bring her to the DEO. However, when it is revealed that Armek shape-shifted into Mgann and is now loose in the building, the team realize he could be disguised as any one of them. ', 'N', 'N', 7.8),
	('Supergirl', 'Luthors', 2, 12, 'Yes', 'Yes', 'No', 13, 2, 2017, 'After Metallo breaks out of prison and frees Lillian Luthor, the police blame Lena for his escape and arrest her. Despite overwhelming evidence, Kara refuses to believe her friend is guilty and fights to clear Lenas name. Flashbacks reveal how Lena came to be a Luthor.', 'N', 'N', 8.3),
	('Supergirl', 'Mr. & Mrs. Mxyzptlk', 2, 13, 'Yes', 'Yes', 'No', 20, 2, 2017, 'When Mr. Mxyzptlk, a magical imp, shows up on Earth and declares his love for Kara, she tries to let him down easy, thinking him harmless. However, he decides its a challenge and starts to wreak havoc on National City. Mon-El has seen beings like Mr. Mxyzptlk on Daxam and knows how dangerous they can be. He and Kara argue over how to get rid of Mr. Mxyzptlk, further straining their relationship. Meanwhile, Alex and Maggie celebrate their first Valentines Day together.', 'N', 'N', 7.7),
	('Supergirl', 'Homecoming', 2, 14, 'Yes', 'Yes', 'No', 27, 2, 2017, 'When Jeremiah Danvers is rescued from Cadmus, Alex and Kara are thrilled to have their father back. The Danvers arrange a family dinner to celebrate but things go awry when a suspicious Mon-El starts to question Jeremiah about his sudden return. ', 'N', 'N', 7.6),
	('Supergirl', 'Exodus', 2, 15, 'Yes', 'Yes', 'No', 6, 3, 2017, 'As Alex searches for Jeremiah and Kara investigates a series of alien kidnappings, the sisters realize they must break the rules to foil a new Cadmus plot. In an effort to get Snapper Carr to run a story that would help her stop Cadmus, Kara agrees to set up an interview between Snapper and Supergirl. ', 'N', 'N', 8.5),
	('Supergirl', 'Star-Crossed', 2, 16, 'Yes', 'Yes', 'No', 20, 3, 2017, 'A new villain comes to National City, putting Supergirl on high alert. Meanwhile, Winn\'s girlfriend, Lyra, gets Winn in trouble with the law. Maggie attempts to help Winn but old loyalties get in the way. The Music Meister attacks Supergirl.', 'N', 'N', 7.6),
	('Supergirl', 'Distant Sun', 2, 17, 'Yes', 'Yes', 'No', 27, 3, 2017, 'A large bounty is put out on Supergirl and aliens from far and near attack National City intent on taking out the woman of steel. Alex and Maggie run into Maggies ex-girlfriend, Emily, who is in town for a week. Hank gets an interesting order from President Marsdin.', 'N', 'N', 8),
	('Supergirl', 'Ace Reporter', 2, 18, 'Yes', 'Yes', 'No', 24, 4, 2017, 'Lenas ex-boyfriend, Jack Spheer, comes to National City to unveil his big breakthrough in nano-technology, which has the potential to eradicate all diseases. Lena asks Kara to attend Jacks conference with her for support. When Kara sees Snapper in attendance shes inspired to tap back into her reporter skills and questions Jack on his discovery, which ultimately leads to a bigger investigation that puts everyone in danger. ', 'N', 'N', 7.9),
	('Supergirl', 'Alex', 2, 19, 'Yes', 'Yes', 'No', 1, 5, 2017, 'Alex is kidnapped and the kidnapper threatens to kill her unless Supergirl releases a notorious criminal from prison. Supergirl and Maggie have always had different approaches to apprehending criminals but this time they must work together to save Alex. Meanwhile, Rhea has an interesting proposal for Lena.', 'N', 'N', 8.2),
	('Supergirl', 'City Of Lost Children', 2, 20, 'Yes', 'Yes', 'No', 8, 5, 2017, 'When an alien attacks National City, Supergirl and the DEO learn the alien is a Phorian, an otherwise peaceful race with telekinetic powers. Guardian gets a lead on the Phorians address but instead of finding the culprit, he finds a very scared boy named Marcus. Marcus will only trust James so it is up to Guardian to stop the attacks on the city. Rheas plan escalates.', 'N', 'N', 7.8),
	('Supergirl', 'Resist', 2, 21, 'Yes', 'Yes', 'No', 15, 5, 2017, 'Supergirl grapples with whether or not to obey the President\'s orders regarding Rhea\'s latest actions. Meanwhile, Cat Grant returns to National City.', 'N', 'N', 8.2),
	('Supergirl', 'Nevertheless, She Persisted', 2, 22, 'Yes', 'Yes', 'No', 22, 5, 2017, 'Supergirl challenges Rhea to battle to save National City. Meanwhile, Superman returns and Cat Grant offers Supergirl some sage advice.', 'N', 'N', 7.8),
	('Swat Kats The Radical Squadron', 'The Pastmaster Always Rings Twice', 1, 1, 'Yes', 'Yes', 'NA', 11, 9, 1993, 'Two grave robbers accidentally release the Pastmaster from his 800-year imprisonment within the Casket of the Ages. Disgusted with the modern era, he steals his spellbook, the Tome of Time, from the Megakat City Museum of History and attempts to magically transform the metropolis back to the medieval state he prefers. He summons dinosaurs through a magical time vortex to act as his bodyguards, one of whom knocks the Swat Kats through the portal and into the prehistoric era. Low on time and fuel, the Swat Kats must figure out a way to get back to the present-day Megakat City to stop the Pastmaster.', 'Y', 'N', 6.9),
	('Swat Kats The Radical Squadron', 'The Giant Bacteria', 1, 2, 'Yes', 'Yes', 'NA', 18, 9, 1993, 'The swamp-dwelling Dr. Viper mutates his fellow evildoer Morbulus into a hulking bacteria blob following Morbulus\' humiliating defeat by the Swat Kats. The bacteria monster then goes on a rampage through Megakat City, inconveniently dividing into two anytime it\'s hit. Viper\'s plan is for the monsters to break into the supposedly impenetrable Megakat Biochemical Labs and steal Katalyst 99, a rare biochemical compound he wants. With normal weapons ineffective against the giant bacteria, the Swat Kats quickly discover that the creatures have one weakness: electricity.', 'Y', 'N', 7.5),
	('Swat Kats The Radical Squadron', 'The Wrath Of Dark Kat', 1, 3, 'Yes', 'Yes', 'NA', 25, 9, 1993, 'Criminal mastermind Dark Kat breaks into the Megakat Nuclear Plant and steals the components to build his \'doomsday device\', a powerful nuclear bomb that he plans to drop on the city. Commander Feral sneaks aboard Dark Kat\'s ship, the Doomsday Express, in an effort to stop him, but is quickly captured. Lieutenant-Commander Steele, Feral\'s second in command, assumes control of the Enforcers, but would rather advance his career than rescue his boss. Thus, it\'s up to the Swat Kats to save both Feral and Megakat City.', 'Y', 'N', 7.5),
	('Swat Kats The Radical Squadron', 'Destructive Nature', 1, 4, 'Yes', 'Yes', 'NA', 2, 10, 1993, 'The new, 300-story office building Megakat Towers is open for business, and Mayor Manx is trying to persuade foreign investor Mr. Young to house his corporate headquarters there. But Dr. Viper is back and he ruins Manx\'s plans as he seizes control of the tower with his army of acid-spitting \'plantimals\'. He places a huge spore pod on the roof: when it explodes, it will shower Megakat City with spores, turning the metropolis into one big swamp (\'Megaswamp City\'). Obviously the Swat Kats won\'t allow this. While T-Bone runs interference in the Turbokat, Razor sneaks inside the building to stop Viper with the help of Callie Briggs, who happened to be inside when the building was taken.', 'Y', 'N', 6.7),
	('Swat Kats The Radical Squadron', 'The Metallikats', 1, 5, 'Yes', 'Yes', 'NA', 9, 10, 1993, 'The husband and wife gangster duo Mac and Molly Mange were thought to have died while trying to escape from Alkatraz. Now, for the first time since their \'makeover\', courtesy of inventor Professor Hackle, they\'re back in Megakat City and planning to \'tear up this town like a scratchin\' post!\' But Mac and Molly\'s first priority is getting revenge on those who had wronged them in the past, and at the top their hit list is Mayor Manx. It\'s mayhem down at City Hall as the Swat Kats fight to destroy the seemingly unstoppable Metallikats.', 'Y', 'N', 6.7),
	('Swat Kats The Radical Squadron', 'Bride Of The Pastmaster', 1, 6, 'Yes', 'Yes', 'NA', 16, 10, 1993, 'While in the middle of a battle against sea monsters who are attacking KatCo oil tankers, the Swat Kats become caught in of the Pastmaster\'s time portals, which appears out of nowhere and pulls them back into medieval times. There they find the evil wizard in the midst of laying siege to Megalith City, Megakat City\'s Dark Ages counterpart, with an army of mythological monsters in an effort to force its ruler, Queen Callista, Callie Briggs\' lookalike ancestor, to marry him. And that\'s not the only romantic complication! When Callista sees Razor pull a certain sword from a certain stone, she falls in love with him, causing T-Bone to become jealous.', 'Y', 'N', 6.4),
	('Swat Kats The Radical Squadron', 'Night Of The Dark Kat', 1, 7, 'Yes', 'Yes', 'NA', 23, 10, 1993, 'Dark Kat enlists the assistance of technology thief and \'high-voltage low-life\' Hard Drive to destroy both the Swat Kats and their reputation as heroes. After the villains lure the vigilantes into a death trap in Dark Kat\'s hideout, Hard Drive uses the stolen Turbokat to pose as the Swat Kats and commit various crimes in order to frame them as criminals. Although T-Bone and Razor manage to free themselves, they find themselves pursued by the Enforcers for the crimes committed by Dark Kat and Hard Drive. With Callie\'s help, they must evade the Enforcers, clear their names, stop Dark Kat, and be back in time to tow a little old lady.', 'Y', 'N', 7),
	('Swat Kats The Radical Squadron', 'Chaos In Crystal', 1, 8, 'Yes', 'Yes', 'NA', 30, 10, 1993, 'An accident with an experimental diamond mining machine, the Gemkat 6000, somehow turns brutal convict Rex Shard, into a crystalline giant whose touch turns people and objects to crystal. And that\'s only the beginning of his new powers. Seeking revenge for his accident, Shard first sets his sights on getting Warden Cyrus Meece, whose greedy exploitation of his prisoners led to the ordeal in the first place, and the Gemkat 6000\'s inventor, Dr. Greenbox, all the while randomly \'crystallizing\' every location he comes across. Can the SWAT Kats find a way to reverse Shard\'s condition before it\'s too late?', 'Y', 'N', 7.4),
	('Swat Kats The Radical Squadron', 'The Ghost Pilot', 1, 9, 'Yes', 'Yes', 'NA', 6, 11, 1993, 'The vengeful spirit of the Red Lynx, Mega War II air ace and the most evil pilot in aviation history, returns from his watery grave after his sunken biplane is found by dockworker and war veteran Abner Doolittle, intending to hunt down and kill the only living descendant of the flier who put him there, the Blue Manx. Said descendant is, of course, none other than Mayor Manx. Can even the Swat Kats shoot down the Red Lynx? And can Mayor Manx overcome his cowardice even to save his own life? He\'ll have to, especially once the ever-helpful Dr. Sinian discovers that only a relative of the Blue Manx, such as the Mayor, can destroy the Red Lynx for good.', 'Y', 'N', 6.2),
	('Swat Kats The Radical Squadron', 'Metal Urgency', 1, 10, 'Yes', 'Yes', 'NA', 13, 11, 1993, 'Professor Hackle intends to reprogram the Metallikats to be good, but Mac and Molly escape from his lab before he can. In search of their armored hovercraft, the Metallikat Express, they wind up in the salvage yard near Jake \'n\' Chance\'s Garage. There, they inadvertently discover the hidden Swat Kats hangar and thus uncover the secret identities of the vigilantes themselves! Chance and Jake, in their civvies, must defend their own base from the murderous, mechanical gangsters. Although their bodies are destroyed, the Metallikats survive as disembodied heads crawling around on spiderlike legs, and eventually take control of two Puma-Dyne Macrobots, giant and powerful space exploration robots, and begin to trash the city. Now, the Swat Kats must stop the Metallikats from revealing their secret and save the city!', 'Y', 'N', 7.5),
	('Swat Kats The Radical Squadron', 'The Ci-Kat-A', 1, 11, 'Yes', 'Yes', 'NA', 20, 11, 1993, 'Hitching a ride aboard the deep space probe Kat Sat 1, cicada-like aliens with pointed, cat-like ears take over the M.A.S.A. Space Center, biting the Kat Sat 1\'s creator, astronomer Dr. Harley Street, and others, turning them into literally bug-eyed slaves as part of their plan for world conquest. Ann Gora, seeking an interview with Dr. Street regarding the success of the Kat Sat 1, stumbles onto their plans and is quick to alert the authorities. It\'s up to the SWAT Kats (who else?) to thwart the invasion, with poor T-Bone fighting his fear of bugs every step of the way.', 'Y', 'N', 6.9),
	('Swat Kats The Radical Squadron', 'Enter The Madkat', 1, 12, 'Yes', 'Yes', 'NA', 27, 11, 1993, 'Comedian Lenny Ringtail, whose mind snapped after he lost the title of \'King of Late Night\' to his rival David Litterbin, allows himself to be possessed by the ghost of Madkat, a jester who suffered a similar rejection hundreds of years ago. The result is a wisecracking, shapeshifting harlequin who uses his magical powers to kidnap the \'Kin\', \'Queen, \'Knight\' and \'Jeste\'r, or Mayor Manx, Callie Briggs, Commander Feral and Litterbin, respectively, imprisoning all but Callie within a magic puzzle box and vanishing into thin air before the Swat Kats can stop him. Can they find his weakness in time to save Callie?', 'Y', 'N', 7.3),
	('Swat Kats The Radical Squadron', 'Katastrophe', 1, 13, 'Yes', 'Yes', 'NA', 4, 12, 1993, 'After being beaten by the Swat Kats because they were too busy fighting each other, Dark Kat and Dr. Viper decide to team up and unite against their common enemies. They recruit the Metallikats to their cause, forming the Invincible Alliance of Evil, whose only purpose is to kill the Swat Kats once and for all. Kidnapping Mayor Manx and Callie, the villains give the Swat Kats an ultimateum - surrender by sunrise or risk the deaths of the hostages. Can the Swat Kats find a way to rescue Manx and Callie without giving themselves up? And will Commander Feral lend a helping hand?', 'Y', 'N', 8.1),
	('Swat Kats The Radical Squadron', 'Mutation City', 2, 1, 'Yes', 'Yes', 'NA', 10, 9, 1994, 'Dr. Viper floods Megakat City with Katalyst X-63, a \'hideous mutating ooze\' that turns normal animals into giant monsters. With the city submerged in slime and infested by huge, repulsive mutants, the Swat Kats must undertake a perilous mission to Megakat Biochemical Labs, where they must retrieve the antimutagens needed to restore everything to normal. T-Bone, who can\'t swim, nearly drowns in the slime, and later becomes a mutant himself when one of the creatures bites him. Worse, Dr. Viper eventually uses the katalyst on himself, turning into a skyscraper-sized monstrosity.', 'Y', 'N', 7.6),
	('Swat Kats The Radical Squadron', 'A Bright And Shiny Future', 2, 2, 'Yes', 'Yes', 'NA', 17, 9, 1994, 'The Pastmaster returns and sends the Swat Kats through one of his time portals and into Megakat City\'s future, where Mac and Molly Mange rule a nightmare world of killer robots (called \'Metallitack Units\'), confining \'non-metallic creatures\' to slave labor camps, and the vigilantes\' friends are rebel freedom-fighters. But the worst part is that the Swat Kats\' future selves are dead, killed by the Metallikats when they took over. Now, it\'s up to the pilots from the past to set things right. But when the older Callie and Mayor Manx are kidnapped by the Metallitack Units, the Swat Kats form an uneasy alliance with the Pastmaster, who wants revenge against Mac and Molly for doublecrossing him. Together with Commander Feral and Felina, they storm Metallikat Headquarters.', 'Y', 'N', 8.1),
	('Swat Kats The Radical Squadron', 'When Strikes Mutilor', 2, 3, 'Yes', 'Yes', 'NA', 24, 9, 1994, 'A group of alien space pirates, led by the evil Mutilor, arrive over the skies of Megakat City, planning to drain the planet\'s water using a ship stolen from a peaceful race of cat-like aliens called the Aquians, to sell to another race of aliens altogether, the Zarhabi. With the Turbokat still in repairs, the Swat Kats must employ other methods of battling against the invaders to defend their world.', 'Y', 'N', 6.4),
	('Swat Kats The Radical Squadron', 'Razor\'s Edge', 2, 4, 'Yes', 'Yes', 'NA', 29, 10, 1994, 'Razor\'s self-confidence is shattered when he believes he has injured two elderly civilians during the Swat Kats\' pursuit of Dark Kat. Discouraged, he quits the team, leaving T-Bone to face Dark Kat\'s latest evil plot alone. This time around, the criminal mastermind plans to destroy Megakat City with his robotic spider craft, the Black Widow, which grows bigger whenever it absorbs power! Can T-Bone succeed on his own, or will Razor regain his confidence and return to the SwatKats?', 'Y', 'N', 7.8),
	('Swat Kats The Radical Squadron', 'Cry Turmoil', 2, 5, 'Yes', 'Yes', 'NA', 5, 11, 1994, 'A new villain, Turmoil, attempts to seize control of the skies over Megakat City and ransom their use for the \'paltry sum\' of $2 million in gold each week. Backing her up is the Omega Squadron, her own private air force comprised entirely of female pilots, as well as the Vertigo Beam, a powerful ray cannon that causes pilots to become disoriented and crash. Obviously the Swat Kats are having none of this nonsense. When T-Bone both outflies the Omega Squadron and successfully recovers from the effects of the Vertigo Beam, Turmoil is impressed. She attempts to persuade him to join her side, and, truly remarkably, he accepts; first, though, he must prove his loyalty by killing Razor!', 'Y', 'N', 8),
	('Swat Kats The Radical Squadron', 'Swat Kats Unplugged', 2, 6, 'Yes', 'Yes', 'NA', 5, 11, 1994, 'Hard Drive is back, with a new Surge Coat, and this time he uses a new antiweapons scrambler stolen from Puma-Dyne to deactivate the Turbokat\'s weapon systems when they try to stop him from stealing a shipment of gold. Defenseless, the Swat Kats realize that they\'re going to have to outwit Hard Drive', 'Y', 'N', 8),
	('Swat Kats The Radical Squadron', 'The Deadly Pyramid', 2, 7, 'Yes', 'Yes', 'NA', 12, 11, 1994, 'An archaeological expedition led by Dr. Abby Sinian in search of the Lost Pyramid of Katchu Pitchu instead encounters the Pastmaster, who unearths the pyramid by himself using the equally long-lost Jeweled Headdress of Katchu Pitchu in order to reanimate the dead monarch\'s army of giant mummy warriors. He sends them to destroy Megakat City and kill Mayor Manx, but when one of them knocks off Callie Briggs\' glasses, he notices her resemblance to to his beloved Queen Callista. He soon abducts her and tries to force her to marry him, and only the Swat Kats can stop him, aided by a friendly robot named Cybertron given to them by Professor Hackle.', 'Y', 'N', 7.3),
	('Swat Kats The Radical Squadron', 'Caverns Of Horror', 2, 8, 'Yes', 'Yes', 'NA', 19, 11, 1994, 'The Megakat Metallurgical Company has some problems: several of their miners have gone missing deep in the company\'s agracite mines. The Enforcers are called in to investigate by Taylor, the company\'s mining foreman, with Ann Gora tagging along incognito as a miner. When she too disappears, it\'s up to the Swat Kats, with help from Lt. Felina Feral, to enter the mines and find her. They soon discover the root of the problem, too - a horde of giant scorpions mutated by toxic waste that was illegally dumped by Megakat Metallurgical\'s president, Tiger Conklin.', 'Y', 'N', 5.6),
	('Swat Kats The Radical Squadron', 'The Origin Of Dr Viper', 2, 9, 'Yes', 'Yes', 'NA', 26, 11, 1994, 'Mayor Manx and Mr. Young plan to build an industrial park on tropical Anakata Island, but a bulldozer accidentally plows into and breaks breaks the sacred Talisman Stone, which is said to keep the demon Volcanus asleep within the island\'s central volcano. Naturally, the beast is soon set free and heads towards the mainland with the intent of smashing everything in sight. Only the Swat Kats can stop him, but Volcanus is impervious to almost everything! Can he be stopped before he destroys the Megakat Nuclear Plant?', 'Y', 'N', 6.7),
	('Swat Kats The Radical Squadron', 'Volcanus Erupts!', 2, 10, 'Yes', 'Yes', 'NA', 26, 11, 1994, 'Dr. N. Zyme and his colleague Dr. Elrod Purvis co-develop Viper Mutagen 368, a regenerative growth formula derived from snake DNA. When Zyme reveals his intention to donate the formula to the city, the greedy Purvis attempts to steal it to sell to the highest bidder. In the process however, he ends up spilling it on himself and seems to die, but is soon revived as the twisted mutant Dr. Viper! And when Viper hatches a scheme to mutate Zyme, Mayor Manx, and Callie Briggs', 'Y', 'N', 6.7),
	('Swat Kats The Radical Squadron', 'The Dark Side Of The Swat Kats', 2, 11, 'Yes', 'Yes', 'NA', 10, 12, 1994, 'A stray lightening bolt hits the Turbokat while the Swat Kats are testing their new dimensional radar system, which results in them being hurled into an alternate dimension where evil versions of themselves are not only wanted for just about every crime in Megakat City, but are also working for Dark Kat. Mistaken for the Dark Swat Kats by Dark Kat, T-Bone and Razor are sent to Puma-Dyne to steal the Mega-Detonator, a key component for an implosion bomb which the criminal mastermind plans to use to destroy Enforcer Headquarters. When Dark Kat realizes he\'s been had, he sends the real Dark Swat Kats to kill their good counterparts and acquire the Mega-Detonator. Making things even more complicated for the vigilante duo are the fact that Callie Briggs is also evil and in on Dark Kat\'s plot, but the Enforcers mistake them for the Dark Swat Kats and are after them, too.', 'Y', 'N', 8.7),
	('Swat Kats The Radical Squadron', 'Unlikely Alloys', 2, 12, 'Yes', 'Yes', 'NA', 24, 12, 1994, 'The Swat Kats stop the Metallikats from robbing the Megakat City Mint, and in the process the two robot gangsters are severely injured, Molly moreso than Mac. When Mac finds out about Dr. Lieter Greenbox\'s new invention, the Micro-Brain Repair Unit which can fix anything, he immediately takes himself and Molly to Greenbox\'s lab and steals the device. The Metallikats use it to repair themselves, but in the process the device becomes contaminated by their criminal programming. Achieving sentience, it names itself Zed and proceeds to go on a citywide rampage, assimilating all manner of metal and machinery (including Mac!) onto itself, constructing an ever-growing armored shell. Naturally, only the Swat Kats can stop Zed, with some help from a vengeful Molly. Unfortunately, Zed\'s next stop is Puma-Dyne, where it plans to get its hands on the Mega-Beam laser weapon. Worse, Greenbox has become so impressed by what his genius has wrought that he\'s gone completely looney-tunes and is doing eve', 'Y', 'N', 6.8),
	('Swat Kats The Radical Squadron', 'Kats Eye News - A Special Report', 2, 13, 'Yes', 'Yes', 'NA', 4, 1, 1995, 'The finale of the Swat Kats series finally arrives, as Ann Gora, Tiger Shark, and Tom Cat, report on all the historical adventures of the Swat Kats. T-Bone and Razor are highlighted in several instances with the numerous weapons and vehicles they operate, along with certian maneuvers they perform to get away from trouble. During the show, several questions are mentioned in the SKIQ, The Swat Kats Inside Quiz. Subjects include a multiple choice Q and A with a situation pops out, a situation based exam on what you would do if you were the Swat Kats, and then a segement called \'Name That Villan\'.', 'Y', 'N', 6.4),
	('The Big Bang Theory', 'Pilot', 1, 1, 'Yes', 'Yes', 'No', 24, 9, 2007, 'Brilliant physicist roommates Leonard and Sheldon meet their new neighbor Penny, who begins showing them that as much as they know about science, they know little about actual living.', 'Y', 'N', 8.4),
	('The Big Bang Theory', 'The Big Bran Hypothesis', 1, 2, 'Yes', 'Yes', 'No', 1, 10, 2007, 'Leonard volunteers to sign for a package in an attempt to make a good impression on Penny, but when he enlists Sheldon for help, his attempt at chivalry goes terribly awry.', 'Y', 'N', 8.5),
	('The Big Bang Theory', 'The Fuzzy Boots Corollary', 1, 3, 'Yes', 'Yes', 'No', 8, 10, 2007, 'Leonard asks a woman out after he finds out that Penny is seeing someone.', 'Y', 'N', 7.9),
	('The Big Bang Theory', 'The Luminous Fish Effect', 1, 4, 'Yes', 'Yes', 'No', 15, 10, 2007, 'Sheldon\'s getting fired forces him to explore what life has to offer outside physics, leaving Leonard to take drastic action to snap his friend out of his funk.', 'Y', 'N', 8.3),
	('The Big Bang Theory', 'The Hamburger Postulate', 1, 5, 'Yes', 'Yes', 'No', 22, 10, 2007, 'Fearing he\'s wasting his time on Penny, Leonard ends up making a connection with Leslie.', 'Y', 'N', 8.1),
	('The Big Bang Theory', 'The Middle Earth Paradigm', 1, 6, 'Yes', 'Yes', 'No', 29, 10, 2007, 'Penny hosts a Hallowe\'en party, putting Leonard, Sheldon, Wolowitz, and Koothrappali through a new test of their social skills.', 'Y', 'N', 8.6),
	('The Big Bang Theory', 'The Dumpling Paradox', 1, 7, 'Yes', 'Yes', 'No', 5, 11, 2007, 'With Wolowitz AWOL with one of her friends, Penny\'s recruited to fill in for him on the guys\' Halo team.', 'Y', 'N', 8.3),
	('The Big Bang Theory', 'The Grasshopper Experiment', 1, 8, 'Yes', 'Yes', 'No', 12, 11, 2007, 'Raj\'s parents set him up on a blind date, but just when he discovers he can talk to her, she shows interest in Sheldon.', 'Y', 'N', 8.4),
	('The Big Bang Theory', 'The Cooper-Hofstadter Polarization', 1, 9, 'Yes', 'Yes', 'No', 17, 3, 2008, 'When they\'re invited to present at a physics conference, Sheldon\'s reluctance to share the credit leads to a tiff between him and Leonard, and Penny\'s intervention only exacerbates the situation.', 'Y', 'N', 8.2),
	('The Big Bang Theory', 'The Loobenfeld Decay', 1, 10, 'Yes', 'Yes', 'No', 24, 3, 2008, 'Leonard and Sheldon each lie to avoid seeing Penny\'s concert, but Sheldon\'s is a bit too complicated for his own good.', 'Y', 'N', 8.2),
	('The Big Bang Theory', 'The Pancake Batter Anomaly', 1, 11, 'Yes', 'Yes', 'No', 31, 3, 2008, 'With his friends knowing how sour he acts when sick and avoiding him as a result Sheldon is nursed by Penny, who hasn\'t a clue what she\'s in for.', 'Y', 'N', 8.3),
	('The Big Bang Theory', 'The Jerusalem Duality', 1, 12, 'Yes', 'Yes', 'No', 14, 4, 2008, 'With Sheldon rattled over meeting Dennis, a 15-year-old physicist who\'s smarter than he, Leonard helps him look for a way to debunk Dennis\'s research.', 'Y', 'N', 8.1),
	('The Big Bang Theory', 'The Bat Jar Conjecture', 1, 13, 'Yes', 'Yes', 'No', 21, 4, 2008, 'Sheldon finds himself booted from the gang\'s Physics Bowl team and replaced with Leslie, so he forms his own team, hoping to prove he\'s superior.', 'Y', 'N', 8.4),
	('The Big Bang Theory', 'The Nerdvana Annihilation', 1, 14, 'Yes', 'Yes', 'No', 28, 4, 2008, 'When delivery of another collectible leads to Penny\'s lashing out at Leonard, he decides it\'s time to give up his habit, much to his friends\' protestation.', 'Y', 'N', 8.2),
	('The Big Bang Theory', 'The Porkchop Indeterminacy', 1, 15, 'Yes', 'Yes', 'No', 5, 5, 2008, 'The rest of the gang fall for Sheldon\'s twin sister, and Leonard\'s plan to win her heart is derailed when Sheldon declares he\'ll be the one to decide who can date her.', 'Y', 'N', 8.4),
	('The Big Bang Theory', 'The Peanut Reaction', 1, 16, 'Yes', 'Yes', 'No', 12, 5, 2008, 'Penny wants to throw a surprise party for Leonard, but Sheldon\'s indulgence at an electronics store throws her off-track.', 'Y', 'N', 8.5),
	('The Big Bang Theory', 'The Tangerine Factor', 1, 17, 'Yes', 'Yes', 'No', 19, 5, 2008, 'Penny\'s break-up spurs Leonard to summon the courage to ask her out, and each goes to Sheldon for advice on their upcoming date.', 'Y', 'N', 8.7),
	('The Big Bang Theory', 'The Bad Fish Paradigm', 2, 1, 'Yes', 'Yes', 'No', 22, 9, 2008, 'Penny\'s first date with Leonard goes awry. Penny finds Sheldon to be an unwilling confidant.', 'Y', 'N', 8.4),
	('The Big Bang Theory', 'The Codepiece Topology', 2, 2, 'Yes', 'Yes', 'No', 29, 9, 2008, 'A jealous Leonard reacts to Penny\'s new guy by rebounding with Leslie.', 'Y', 'N', 8.3),
	('The Big Bang Theory', 'The Barbarian Sublimation', 2, 3, 'Yes', 'Yes', 'No', 6, 10, 2008, 'Sheldon creates a monster when he introduces Penny to online gaming.', 'Y', 'N', 8.9),
	('The Big Bang Theory', 'The Griffin Equivalency', 2, 4, 'Yes', 'Yes', 'No', 13, 10, 2008, 'Raj gets an inflated ego and makes a play for Penny after being referenced in a magazine article.', 'Y', 'N', 8.1),
	('The Big Bang Theory', 'The Euclid Alternative', 2, 5, 'Yes', 'Yes', 'No', 20, 10, 2008, 'Leonard and his friends stage an intervention to force Sheldon to face his fear of driving.', 'Y', 'N', 8.5),
	('The Big Bang Theory', 'The Cooper-Nowitzki Theorem', 2, 6, 'Yes', 'Yes', 'No', 3, 11, 2008, 'Sheldon and the gang are confused when a young grad student is attracted to him.', 'Y', 'N', 8.4),
	('The Big Bang Theory', 'The Panty Pinata Polarization', 2, 7, 'Yes', 'Yes', 'No', 10, 11, 2008, 'When Sheldon bans Penny from the apartment for numerous minor infractions, she decides to retaliate.', 'Y', 'N', 8.8),
	('The Big Bang Theory', 'The Lizard-Spock Expansion', 2, 8, 'Yes', 'Yes', 'No', 17, 11, 2008, 'Leonard inadvertently steals away the new woman Wolowitz thinks is the love of his life.', 'Y', 'N', 8.3),
	('The Big Bang Theory', 'The White Asparagus Triangulation', 2, 9, 'Yes', 'Yes', 'No', 24, 11, 2008, 'Sheldon is thrilled when Leonard starts dating a woman who meets Sheldon\'s stringent standards.', 'Y', 'N', 8.3),
	('The Big Bang Theory', 'The Vartabedian Conundrum', 2, 10, 'Yes', 'Yes', 'No', 8, 12, 2008, 'Leonard asks Penny for advice when his new relationship starts moving too fast.', 'Y', 'N', 7.9),
	('The Big Bang Theory', 'The Bath Item Gift Hypothesis', 2, 11, 'Yes', 'Yes', 'No', 15, 12, 2008, 'Penny starts dating Leonard\'s handsome colleague. Leonard and his friends are tortured by Sheldon\'s obsession with gift-giving etiquette.', 'Y', 'N', 9.2),
	('The Big Bang Theory', 'The Killer Robot Instability', 2, 12, 'Yes', 'Yes', 'No', 12, 1, 2009, 'Penny\'s criticism of Wolowitz\'s romantic life pushes him into depression and AWOL for a fighting robot battle the rest of guys are depending on him for.', 'Y', 'N', 8.1),
	('The Big Bang Theory', 'The Friendship Algorithm', 2, 13, 'Yes', 'Yes', 'No', 19, 1, 2009, 'Sheldon creates a scientific procedure for making friends.', 'Y', 'N', 8.2),
	('The Big Bang Theory', 'The Financial Permeability', 2, 14, 'Yes', 'Yes', 'No', 2, 2, 2009, 'Sheldon\'s solution to Penny\'s financial difficulty leads to a confrontation between Leonard and Penny\'s ex-boyfriend.', 'Y', 'N', 8.2),
	('The Big Bang Theory', 'The Maternal Capacitance', 2, 15, 'Yes', 'Yes', 'No', 9, 2, 2009, 'Leonard and Penny are drawn together after a disastrous visit from Leonard\'s mother.', 'Y', 'N', 9),
	('The Big Bang Theory', 'The Cushion Saturation', 2, 16, 'Yes', 'Yes', 'No', 2, 3, 2009, 'A paintball game leads to a fight between Sheldon and Penny, and romance for Leslie and Wolowitz.', 'Y', 'N', 8.3),
	('The Big Bang Theory', 'The Terminator Decoupling', 2, 17, 'Yes', 'Yes', 'No', 9, 3, 2009, 'Leonard, Sheldon and Wolowitz are ecstatic to learn that a famous science-fiction actress is on board the train they are taking to San Francisco.', 'Y', 'N', 8.4),
	('The Big Bang Theory', 'The Work Song Nanocluster', 2, 18, 'Yes', 'Yes', 'No', 16, 3, 2009, 'Penny\'s home business turns into a complete nightmare when Sheldon takes over.', 'Y', 'N', 8.3),
	('The Big Bang Theory', 'The Dead Hooker Juxtaposition', 2, 19, 'Yes', 'Yes', 'No', 30, 3, 2009, 'Penny squares off with a new beautiful female neighbor who may become the building\'s \'new Penny\'.', 'Y', 'N', 8.4),
	('The Big Bang Theory', 'The Hofstadter Isotope', 2, 20, 'Yes', 'Yes', 'No', 13, 4, 2009, 'A fellow comic book enthusiast\'s hitting on Penny leads to Leonard and Howard going to a bar\'s Ladies\' Night.', 'Y', 'N', 8.1),
	('The Big Bang Theory', 'The Vegas Renormalization', 2, 21, 'Yes', 'Yes', 'No', 27, 4, 2009, 'Leonard and Koothrappali escort a heartbroken Wolowitz to Las Vegas, and Sheldon becomes locked out of his apartment and must stay with Penny.', 'Y', 'N', 8.7),
	('The Big Bang Theory', 'The Classified Materials Turbulence', 2, 22, 'Yes', 'Yes', 'No', 4, 5, 2009, 'Penny\'s second date with Stuart sees her making a comment that gives Leonard new hope for a relationship with her. Wolowitz realizes there\'s a crucial error in a NASA project he\'s working on.', 'Y', 'N', 8.4),
	('The Big Bang Theory', 'The Monopolar Expedition', 2, 23, 'Yes', 'Yes', 'No', 11, 5, 2009, 'The guys\' plan to work over the summer at the North Pole makes Penny revaluate her feelings for Leonard.', 'Y', 'N', 8.4),
