	('The Big Bang Theory', 'The Separation Agitation', 10, 21, 'Yes', 'Yes', 'No', 13, 4, 2017, 'Howard and Bernadette have a hard time leaving Halley in day care when Bernadette returns to work. Also, Bert introduces the gang to his new girlfriend, Rebecca.', 'N', 'N', 7.3),
	('The Big Bang Theory', 'The Cognition Regeneration', 10, 22, 'Yes', 'Yes', 'No', 27, 4, 2017, 'Leonard isnt thrilled when Penny considers taking a new job offered by her ex-boyfriend, Zack', 'N', 'N', 6.6),
	('The Big Bang Theory', 'The Gyroscopic Collapse', 10, 23, 'Yes', 'Yes', 'No', 4, 5, 2017, 'Amy is offered a Fellowship at Princeton, Raj makes new living arrangements, and the gyroscope project is spinning out of control!', 'N', 'N', 6.9),
	('The Big Bang Theory', 'The Long Distance Dissonance', 10, 24, 'Yes', 'Yes', 'No', 11, 5, 2017, 'The gang is concerned when Sheldons former admirer, Dr. Ramona Nowitzki, resurfaces while Amy is away at Princeton. ', 'N', 'N', 8.3),
	('The Fall', 'Dark Descent', 1, 1, 'Yes', 'Yes', 'Yes', 12, 5, 2013, 'When a Belfast murder remains unsolved, Stella Gibson is brought in to catch the killer.', 'N', 'N', 8),
	('The Fall', 'Darkness Visible', 1, 2, 'Yes', 'Yes', 'Yes', 19, 5, 2013, 'DSI Stella Gibson\'s fears are realised as Spector\'s murder spree in Belfast continues.', 'N', 'N', 8.1),
	('The Fall', 'Insolence & Wine', 1, 3, 'Yes', 'Yes', 'Yes', 26, 5, 2013, 'As DSI Stella Gibson takes control of the hunt for the serial killer striking women in Belfast, the realisation that his perfect kill is tainted pushes Spector into looking for his next victim.', 'N', 'N', 8.1),
	('The Fall', 'My Adventurous Song', 1, 4, 'Yes', 'Yes', 'Yes', 2, 6, 2013, 'When Eastwood\'s investigation into Olson\'s murder throws open some uncomfortable truths for Burns, Gibson comes under increased pressure in her hunt for Belfast\'s killer.', 'N', 'N', 8.3),
	('The Fall', 'The Vast Abyss', 1, 5, 'Yes', 'Yes', 'Yes', 9, 6, 2013, 'Gibson arrives at the Annie Brawley crime scene and realises it is the work of the serial killer, while Burns and his team are still trying to piece together the events surrounding Olson\'s murder. Spector raises Sally Ann\'s suspicions when he asks her to provide him with an alibi and he decides to make one final play with Gibson that will bring the two hunters closer than either could have previously imagined', 'N', 'N', 8.4),
	('The Fall', 'These Troublesome Disguises', 2, 1, 'Yes', 'Yes', 'Yes', 9, 11, 2014, 'It has been ten days since Paul Spector told DSI Stella Gibson that she would never catch him. As Gibson tries in vain to help Spector\'s surviving victim to remember the identity of her attacker, Spector is forced to deal with the loose ends that he left behind in Belfast. His return to the city reveals that someone from his past has been helping police with their enquiries, forcing Spector to change his plans with terrifying consequences.', 'N', 'N', 8.1),
	('The Fall', 'Night Darkens The Streets', 2, 2, 'Yes', 'Yes', 'Yes', 16, 11, 2014, 'Gibson realises that her mistakes have put the life of witness Rose Stagg in danger. Desperate to save Rose\'s life, she steps up the police investigation as serial killer Paul Spector continues to stalk Belfast\'s streets.', 'N', 'N', 8.3),
	('The Fall', 'Beauty Hath Strange Power', 2, 3, 'Yes', 'Yes', 'Yes', 23, 11, 2014, 'Gibson orders extensive surveillance on Spector\'s family, believing they will lead them to Paul, whose whereabouts remain unknown. As the search for Rose Stagg becomes ever more desperate, Spector directs his fury at Gibson after the two narrowly avoid meeting, trespassing into her private world and delighting in taunting and provoking her.', 'N', 'N', 8.5),
	('The Fall', 'The Mind Is Its Own Place', 2, 4, 'Yes', 'Yes', 'Yes', 30, 11, 2014, 'Gibson informs Burns that their confrontation in her hotel room may have been witnessed by Spector, and the detective is shocked to discover the serial killer has been paying visits to one of his surviving victims in hospital. Seizing on the opportunity, she finally locates Spector and puts him under surveillance, but her success is short-lived as she is forced to face her worst fears.', 'N', 'N', 8.2),
	('The Fall', 'The Perilous Edge Of Battle', 2, 5, 'Yes', 'Yes', 'Yes', 7, 12, 2014, 'With Spector under surveillance, Gibson wants to make sure that a solid arrest strategy is put in place so that no evidence is lost and the police have the best chance of saving Rose Stagg. However, the killer\'s unpredictability forces the detective to act quickly as her carefully laid plans fall apart in front of her eyes.', 'N', 'N', 8.7),
	('The Fall', 'What Is In Me Dark Illumine', 2, 6, 'Yes', 'Yes', 'Yes', 17, 12, 2014, 'Gibson\'s investigation leads her to the killer\'s lair, but there is no sign of Rose Stagg and the detective instructs her team to step up the interviews with Katie, Sally Ann and Spector in a desperate attempt to find her. However, it is only when Spector makes a final move to remain in control that Gibson is offered any answers. ', 'N', 'N', 8.6),
	('The Fall', 'Silence And Suffering', 3, 1, 'Yes', 'Yes', 'Yes', 25, 9, 2016, 'Stella Gibson has arrested Spector but will he survive the gunshot wounds sustained in police custody? Will he ever face justice? Paul Spector is rushed to Belfast General Hospital where Dr Joe O\'Donnell, nurse Kiera Sheridan and the staff engage in the blood-soaked fight to keep him alive. News of Spector\'s arrest and life-threatening injuries reach Katie and she plots to help him. With the powers that be questioning Gibson\'s handling of the case, her determination to get a conviction is tested to the full.', 'N', 'N', 7.4),
	('The Fall', 'His Troubled Thoughts', 3, 2, 'Yes', 'Yes', 'Yes', 2, 10, 2016, 'Gibson and Burns are hauled over the coals by the Police Ombudsman and the Policing Executive for their conduct and handling of the case. When Spector\'s name is released to the press as the arrested suspect in the Belfast Strangler case, his wife and family are forced to deal with the consequences. Katie enraged at the media treatment of him, decides to take matters into her own hands. All the while Nurse Kiera Sheridan and the medical team continue to fight to keep Spector alive. But even if he survives will he ever be fit enough to stand trial?', 'N', 'N', 7.6),
	('The Fall', 'The Gates Of Light', 3, 3, 'Yes', 'Yes', 'Yes', 9, 10, 2016, '', 'N', 'N', 8),
	('The Fall', 'The Hell Within Him', 3, 4, 'Yes', 'Yes', 'Yes', 16, 10, 2016, '', 'N', 'N', 7.7),
	('The Fall', 'Wounds Of Deadly Hate', 3, 5, 'Yes', 'Yes', 'Yes', 23, 10, 2016, '', 'N', 'N', 8.2),
	('The Fall', 'Their Solitary Way', 3, 6, 'Yes', 'Yes', 'Yes', 30, 10, 2016, '', 'N', 'N', 9),
	('The Flash', 'City Of Heroes', 1, 1, 'Yes', 'Yes', 'Yes', 8, 10, 2014, 'Nine months after the S.T.A.R. Labs explosion, Barry awakens to find a lot has changed while he was in a coma. With his new friends and powers Barry must try to right the wrongs of his new mentor, the owner of S.T.A.R. Labs.', 'Y', 'N', 8.6),
	('The Flash', 'Fastest Man Alive', 1, 2, 'Yes', 'Yes', 'Yes', 15, 10, 2014, 'Barry escorts Iris to a university gathering honoring scientist Simon Stagg. When six gunmen storm the event, Barry changes into The Flash and tries to stop them. While he does save a man\'s life, he passes out before he can capture the robbers, which frustrates him. As Dr. Wells, Caitlin and Cisco scramble to find out what\'s wrong with Barry, Joe comes down hard on Barry for taking the law into his own hands and risking his life. Barry realizes that it wasn\'t six gunmen but a metahuman named Danton Black, who can make multiples of himself. Meanwhile, Iris becomes even more intrigued by the \'red streak\'.', 'Y', 'N', 8.5),
	('The Flash', 'Things You Can\'t Outrun', 1, 3, 'Yes', 'Yes', 'Yes', 22, 10, 2014, 'As Barry and the team at S.T.A.R. Labs work to capture Kyle Nimbus, a.k.a. The Mist, a dangerous new meta-human with toxic gas powers, they revisit the painful night the particle accelerator exploded and killed Caitlin\'s fiance, Ronnie. Meanwhile, Joe decides to finally visit Henry in jail after all these years, but things take a dangerous turn when Kyle shows up looking to punish Joe for arresting him years ago. Meanwhile, Iris and Eddie continue to hide their relationship from Joe.', 'Y', 'N', 8.3),
	('The Flash', 'Going Rogue', 1, 4, 'Yes', 'Yes', 'Yes', 29, 10, 2014, 'The Flash stops a robbery but the culprits get away after shooting a guard, and The Flash chooses to save the man instead of following the criminals. Joe shows Barry a book of suspects and Barry identifies Leonard Snart as the leader of the group. Snart revises his plan to steal the Kahndaq Dynasty Diamond and gets a boost when he gets his hands on a stolen \'cold gun\', which could kill The Flash. Dr. Wells is furious when he finds out that Cisco built the cold gun without telling anyone and now it\'s missing. Meanwhile, Iris is getting the silent treatment from Joe because of her relationship with Eddie.', 'Y', 'N', 8.8),
	('The Flash', 'Plastique', 1, 5, 'Yes', 'Yes', 'Yes', 12, 11, 2014, 'After a bomb goes off downtown, the army, led by General Eiling, rolls in and takes over the case, much to Joe\'s surprise. Suspicious, Joe tells Barry that he and his friends at S.T.A.R. Labs should look into the army\'s involvement. Wells informs the team that Eiling was experimenting on his men to turn them into super soldiers. Cisco confirms one of Eiling\'s soldiers, Bette Sans Souci, was at the bomb site. The Flash tracks her down and realizes that she\'s not setting off the bombs, she is a meta-human who can blow things up just by touching them. Meanwhile, when Joe learns Iris is writing about \'the streak,\' he tells Barry to make her stop. Barry realizes Iris won\'t listen to him so he decides to have The Flash pay her a visit.', 'Y', 'N', 8.3),
	('The Flash', 'The Flash Is Born', 1, 6, 'Yes', 'Yes', 'Yes', 19, 11, 2014, 'The Flash faces a new meta-human named Tony, who can turn himself into girded steel at will. While Dr. Wells and Caitlin are concerned about Barrys safety, Cisco comes up with a plan to take Tony down. Meanwhile, Iriss blog on The Flash gets her into trouble, and Eddie witnesses Tonys abilities firsthand and begins to ask questions that Joe doesnt want answered. Joe asks Dr. Wells to help him solve Nora Allens murder.', 'Y', 'N', 8.6),
	('The Flash', 'Power Outage', 1, 7, 'Yes', 'Yes', 'Yes', 26, 11, 2014, 'The Flash goes up against Farooq aka Blackout, a metahuman who can harness electricity. During their battle, Farooq zaps The Flash and siphons all his electricity, leaving The Flash without his speed. Dr. Wells, Caitlin and Cisco work to reverse the effects on Barry, but their efforts are disrupted when Farooq comes banging on S.T.A.R. Labs doors in search of Wells, who he blames for his accident. Without Barry\'s powers to protect them, the group must figure out a way to save themselves from the metahuman. Meanwhile, Tockman manages a coup inside the Central City police department and takes several people hostage, including Joe and Iris. While Iris is sure The Flash will save them, Eddie has a trick up his sleeve.', 'Y', 'N', 8.7),
	('The Flash', 'Flash Vs Arrow', 1, 8, 'Yes', 'Yes', 'Yes', 3, 12, 2014, 'Barry is thrilled when Oliver, Felicity and Diggle come to Central City to investigate a case involving a deadly boomerang.', 'Y', 'N', 9.4),
	('The Flash', 'The Man In The Yellow Suit', 1, 9, 'Yes', 'Yes', 'Yes', 10, 12, 2014, 'Barry finds himself face-to-face with his nemesis, the man in the yellow suit, a.k.a. Reverse-Flash, who killed his mother. Barry is frustrated when the Reverse-Flash escapes, but Dr. Wells and Cisco come up with a plan to trap him. All they need is bait, so they turn to Dr. Tina McGee from Mercury Labs to help. Meanwhile, its Christmas at the West household and Iris is in full holiday cheer. Eddie gives her a surprising gift but also leaves her with a question that could change her life. Joe joins the search for the man in yellow and ends up in the crossfire. Caitlin finds Ronnie.', 'Y', 'N', 9.5),
	('The Flash', 'Revenge Of The Rogues', 1, 10, 'Yes', 'Yes', 'Yes', 21, 1, 2015, 'Leonard Snart AKA Captain Cold returns to Central City with a new hotheaded partner in tow  Mick Rory AKA Heat Wave. The duo plan to steal a multi-million dollar painting, but Cold has another agenda while in town  to set a trap for The Flash. Snart and Mick kidnap someone close to The Flash and threaten to kill them unless The Flash shows up for a battle of fire and ice. Barry tells Joe he isnt sure he should take on Snart again after the casualties that happened the last time they fought. Meanwhile, Barry asks Dr. Wells, Caitlin and Cisco to help him double his training efforts so hes ready for the Reverse Flash when he returns to Central City. Iris deals with the aftermath of Barrys confession, and Cisco makes the CCPD a new shield.', 'Y', 'N', 8.4),
	('The Flash', 'The Sound And The Fury', 1, 11, 'Yes', 'Yes', 'Yes', 28, 1, 2015, 'Dr. Wells former protge, Hartley Rathaway, returns to seek revenge on his mentor after being affected by the particle accelerator explosion. Now able to manipulate sound waves, the brilliant Rathaway is a dangerous threat to both Wells and The Flash. Meanwhile, Iris is thrilled when shes hired by the Central City Picture News as their newest cub reporter. Unfortunately, her editor pairs her with a veteran reporter, Mason Bridge, who wants nothing to do with her. Cisco recalls his first day on the job at S.T.A.R. Labs when he met Hartley and Caitlin. Joe asks Eddie for a favor but asks him to keep it a secret from Barry.', 'Y', 'N', 8.5),
	('The Flash', 'Crazy For You', 1, 12, 'Yes', 'Yes', 'Yes', 4, 2, 2015, 'Caitlin takes Barry out to a local karaoke bar to help them both find new loves. Caitlin strikes out but Barry meets a sports reporter and asks her out for a date. Cisco considers Hartley\'s dangerous offer. The team searches for Shawna, a meta-human with teleportation powers.', 'Y', 'N', 8.6),
	('The Flash', 'The Nuclear Man', 1, 13, 'Yes', 'Yes', 'Yes', 11, 2, 2015, 'After Ronnie attacks a physicist, Barry and the team realize they need to go after Caitlin\'s fianc who is now a dangerous meta-human. Barry struggles to balance his duties as The Flash and his relationship with Linda Park. Joe enlists Cisco\'s help to reinvestigate the murder of Nora Allen. General Eiling returns to Central City.', 'Y', 'N', 8.8),
	('The Flash', 'Fallout', 1, 14, 'Yes', 'Yes', 'Yes', 18, 2, 2015, 'After the nuclear explosion separates Ronnie and Dr. Stein, Barry and the team believe both men are safe. Caitlin is thrilled to have her fianc back and prepares to resume their life together while Dr. Stein returns to his wife. When General Eiling targets Firestorm, Ronnie and Dr. Stein must decide if they are safer together or apart. Mason Bridge tells Iris that there is something secretive going on at S.T.A.R. Labs. Dr. Stein gives Barry some important information about time travel.', 'Y', 'N', 9),
	('The Flash', 'Out Of Time', 1, 15, 'Yes', 'Yes', 'Yes', 18, 3, 2015, 'Mark Mardon aka The Weather Wizard appears in Central City intent on avenging his brother Clyde\'s death, and sets his sights on Joe, who shot Clyde. When Mardon attacks Joe and Barry, Barry is able to super-speed them to safety but Mardon gets away. Barry warns Joe not to go after a meta-human alone but Joe doesn\'t listen and ends up in grave danger. Meanwhile, Cisco looks into the night the team captured the Reverse Flash and realizes something doesn\'t add up and begins to wonder whether Joe was right about Dr. Wells. Barry and Linda end up on an awkward double date with Eddie and Iris.', 'Y', 'N', 9.7),
	('The Flash', 'Rogue Time', 1, 16, 'Yes', 'Yes', 'Yes', 25, 3, 2015, 'After going to the past, Barry talks to Harrison Wells about him time traveling and the consequences of changing the timeline. Meanwhile, the Flash learns that Captain Cold and Heat Wave have returned to Central City. This time Snart has brought along his baby sister Lisa aka Golden Glider to help wreak havoc on the city.', 'Y', 'N', 8.6),
	('The Flash', 'Tricksters', 1, 17, 'Yes', 'Yes', 'Yes', 1, 4, 2015, 'A copycat killer who goes by the name \'The Trickster\' starts setting off bombs in Central City. In order to stop the villain, Barry and Joe meet with the original Trickster, a criminal mastermind named James Jesse, who has been imprisoned for 20 years. Things quickly go from bad to worse when the Tricksters unite and take Henry prisoner. Meanwhile, Iris asks Eddie for help with a case and flashbacks show how Harrison Wells came up with the idea for the particle accelerator.', 'Y', 'N', 9.2),
	('The Flash', 'All Star Team Up', 1, 18, 'Yes', 'Yes', 'Yes', 15, 4, 2015, 'Barry is surprised when Felicity Smoak arrives from Starling City along with her boyfriend, Ray Palmer, who flies in as the Atom. Theyve come to visit S.T.A.R. Labs as Ray needs help with his suit. Their timing turns out to be fortuitous because its all hands on deck after a meta human named Brie Larvin unleashes hundreds of robotic bees to attack and kill her former co-workers, including Dr. Tina McGee. A group dinner with Barry, Felicity, Ray, Iris and Eddie turns into a disaster.', 'Y', 'N', 8.5),
	('The Flash', 'Who Is Harrison Wells', 1, 19, 'Yes', 'Yes', 'Yes', 22, 4, 2015, 'Joe and Cisco head to Starling City to continue their investigation of Dr. Wells. While in town, the duo enlists the help of Captain Lance, and Cisco meets the Black Canary, who asks him for a favor. Meanwhile, back in Central City, Barry races to catch a meta-human named Hannibal Bates who can transform himself into every person he touches  which includes Eddie, Iris, Caitlin and even The Flash.', 'Y', 'N', 9.1),
	('The Flash', 'The Trap', 1, 20, 'Yes', 'Yes', 'Yes', 29, 4, 2015, 'While in Wells\' secret room, Barry learns about his battle with the Reverse-Flash in the future, as well as key moments in his life that include marrying Iris, a promotion at the CCPD, and that he created the artificial consciousness known as Gideon in the future. Barry, Caitlin, Cisco and Joe set a trap for Wells. Cisco uses himself as prey which puts him in grave danger. Meanwhile, Eddie makes a decision regarding Iris, which leaves Joe a bit unsettled.', 'Y', 'N', 9.5),
	('The Flash', 'Grodd Lives', 1, 21, 'Yes', 'Yes', 'Yes', 6, 5, 2015, 'Barry must deal with the Reverse Flash\'s latest threat to a member of the group. To make matter worse, Dr. Wells unleashes Grodd on the city in order to distract Barry and the team. Joe, Barry and Cisco head down into the sewers to catch Grodd but the gorilla quickly gets the upper hand after he kidnaps Joe. Iris and Barry have a heart to heart talk.', 'Y', 'N', 8.6),
	('The Flash', 'Rogue Air', 1, 22, 'Yes', 'Yes', 'Yes', 13, 5, 2015, 'As Wells once again gets the upper hand on the S.T.A.R. Labs team, Barry realizes he needs to make a big move and reaches out to an old foe, Captain Cold, for help. Joe and Caitlin warn Barry that Cold can\'t be trusted. True to form, Cold has his own agenda that involves the meta-humans trapped in the containment cells. As things seem to be going from bad to worse, The Flash gets reinforcements - Arrow and Firestorm.', 'Y', 'N', 9.2),
	('The Flash', 'Fast Enough', 1, 23, 'Yes', 'Yes', 'Yes', 20, 5, 2015, 'Wells presents Barry with a life-changing choice. Dr. Martein Stein and Ronnie Raymond return to help the S.T.A.R. Labs team with this final fight.', 'Y', 'N', 9.7),
	('The Flash', 'The Man Who Saved Central City', 2, 1, 'Yes', 'Yes', 'No', 6, 10, 2015, 'Picking up months after the Singularity attacked Central City, Barry is still struggling to forgive himself for Eddie\'s death. Concerned about putting his friends in danger, Barry has pushed everyone away and has chosen to protect the city on his own. When a meta-human named Atom Smasher attacks the city, Iris tells Barry that he needs to let his friends help him protect the citizens of Central City. Meanwhile, Cisco helps Joe with his Meta Task Force.', 'Y', 'N', 8.6),
	('The Flash', 'Flash Of Two Worlds', 2, 2, 'Yes', 'Yes', 'No', 13, 10, 2015, 'Jay Garrick, a mysterious man from Earth-2, appears at S.T.A.R. Labs with a dire warning about an evil speedster named Zoom, who is set on destroying The Flash. Barry and the team must decide if they can trust this stranger even as they face yet another powerful meta-human. Meanwhile, Joe must deal with a determined officer named Patty Spivot who wants to join his meta-human task force.', 'Y', 'N', 8.9),
	('The Flash', 'Family Of Rogues', 2, 3, 'Yes', 'Yes', 'No', 20, 10, 2015, 'When Barry and the team find out Captain Cold has been kidnapped, they form an uneasy alliance with his sister, Lisa. However, Barry feels double-crossed when he finds out Snart is working with his father, Lewis Snart on a heist. Meanwhile, Joe is faced with a difficult decision.', 'Y', 'N', 8.6),
	('The Flash', 'The Fury Of Firestorm', 2, 4, 'Yes', 'Yes', 'No', 27, 10, 2015, 'Barry and the team look for another Firestorm match for Dr. Stein. When the team meets Jefferson \'Jax\' Jackson, Caitlin has her reservations about whether Jax is the right match for Dr. Stein. Iris surprises Joe while Barry and Patty grow closer.', 'Y', 'N', 8.5),
	('The Flash', 'The Darkness And The Light', 2, 5, 'Yes', 'Yes', 'No', 3, 11, 2015, 'Barry learns a new breacher, Dr. Light, has come through the portal and sets off to capture her. Jay tells Barry that Dr. Light was not a threat on Earth-2 and that Barry can reason with her. However, during a fight with The Flash, she blinds him and drops some shocking news about Zoom. Meanwhile, Barry and Patty go out on a date.', 'Y', 'N', 9),
	('The Flash', 'Enter Zoom', 2, 6, 'Yes', 'Yes', 'No', 10, 11, 2015, 'After recent events, Barry decides it\'s time to confront Zoom and comes up with a dangerous plan. Caitlin sides with Jay and deems it too dangerous for Barry to engage with the speed demon. However, Iris shows her support and brings forth a surprising ally. We see what Earth-2 Harrison Wells\' life was like before coming through the breech.', 'Y', 'N', 9.5),
	('The Flash', 'Gorilla Warfare', 2, 7, 'Yes', 'Yes', 'No', 17, 11, 2015, 'Grodd returns to Central City and kidnaps Caitlin. Barry and team race to find her before it\'s too late. Meanwhile, Cisco plans his first date with the new barista at Jitters, Kendra Saunders and Patty begins to suspect Barry is hiding something from her.', 'Y', 'N', 8.5),
	('The Flash', 'Legends Of Today', 2, 8, 'Yes', 'Yes', 'No', 1, 12, 2015, 'Vandal Savage arrives in Central City and sets his sights on Kendra Saunders. After Vandal attacks Kendra and Cisco, they turn to Barry for help. Realizing how dangerous Vandal is, Barry takes Kendra to Star City and asks Oliver and team to hide her until he can figure out how to stop Vandal. However, things quickly go from bad to worse when a man with wings AKA Hawkman shows up and flies off with Kendra. Meanwhile, Harrison develops a serum to make Barry run faster and asks Jay to test it out. This cross-over episode concludes on Arrow\'s season 4 \'Legends of Yesterday\' episode.', 'Y', 'N', 9.2),
	('The Flash', 'Running To Stand Still', 2, 9, 'Yes', 'Yes', 'No', 8, 12, 2015, 'When Mark Mardon AKA The Weather Wizard returns to break Leonard Snart AKA Captain Cold and James Jesse AKA The Trickster out of Iron Heights, Barry must stop these rogues from taking over Central City during Christmas. Meanwhile, Joe and Iris meet Wally West.', 'Y', 'N', 8.8),
	('The Flash', 'Potential Energy', 2, 10, 'Yes', 'Yes', 'No', 19, 1, 2016, 'Now that they\'ve grown closer, Barry considers telling Patty that he is The Flash. Meanwhile, Joe and Iris try to get to know Wally, and the team hunts down a meta-human who can slow time itself.', 'Y', 'N', 8.4),
	('The Flash', 'The Reverse-Flash Returns', 2, 11, 'Yes', 'Yes', 'No', 26, 1, 2016, 'When Cisco gets a vibe of Eobard Thawne, Barry and the team don\'t believe it. But, after an attack at Mercury Labs, Christina McGee confirms that the Reverse Flash is back. Meanwhile, Iris and Francine share a nice moment that brings Iris closer to her brother, Wally.', 'Y', 'N', 9),
	('The Flash', 'Fast Lane', 2, 12, 'Yes', 'Yes', 'No', 2, 2, 2016, 'Barry teams up with Wells to figure out a way to close the breaches, but they are distracted by a meta-human nicknamed Tar Pit who can transform into liquid asphalt. Iris is concerned for Wally\'s safety after she finds out about his drag racing hobby. When he refuses to stop she makes a bold move that puts her in danger.', 'Y', 'N', 8.4),
	('The Flash', 'Welcome To Earth-2', 2, 13, 'Yes', 'Yes', 'No', 9, 2, 2016, 'Barry, Wells and Cisco journey to Earth-2 to rescue Wells\' daughter, Jesse from Zoom. Barry is stunned when he runs into Earth-2 Iris and Joe, but nothing prepares him for meeting Killer Frost and Deathstorm. Meanwhile, back on Earth-1, Jay has to take over the Flash\'s responsibilities when a meta-human nicknamed Geomancer attacks Central City.', 'Y', 'N', 9.5),
	('The Flash', 'Escape From Earth-2', 2, 14, 'Yes', 'Yes', 'No', 16, 2, 2016, 'On Earth-2, the team races to find Zoom\'s lair and asks for help from the most unexpected source. Meanwhile, back on Earth-1, Caitlin rushes to perfect Velocity-9 so that Jay can stop the Geomancer.', 'Y', 'N', 9.2),
	('The Flash', 'King Shark', 2, 15, 'Yes', 'Yes', 'No', 23, 2, 2016, 'When King Shark escapes from an A.R.G.U.S. holding tank, Lila and Diggle travel to Central City to warn The Flash. King Shark shows up at the West house and attacks Joe, Iris, Wally and Barry.', 'Y', 'N', 8.7),
	('The Flash', 'Trajectory', 2, 16, 'Yes', 'Yes', 'No', 22, 3, 2016, 'Having arrived in town intent on creating maximum chaos, Trajectory\'s antics are misinterpreted as having been perpetrated by the Flash himself. Barry thus must quickly uncover the mystery of who is the girl under the mask as well as what is driving her mad desire for speed and destruction.', 'Y', 'N', 8.4),
	('The Flash', 'Flash Back', 2, 17, 'Yes', 'Yes', 'No', 29, 3, 2016, 'After the shocking revelation that Zoom is Jay Garrick, Barry is more determined than ever to get back to Earth-2 to stop Zoom forever. Desperate to find a way to increase his speed, Barry decides to travel back in time and masquerade as his earlier self in order to get his arch-nemesis, Dr. Harrison Wells/Eobard Thawne, to teach him how to run faster. However, things don\'t go as planned and Barry is stunned to face familiar foe Hartley Rathaway, as well as old friend Eddie Thawne. Iris makes peace with her past in order to embrace her future.', 'Y', 'N', 9.2),
	('The Flash', 'Versus Zoom', 2, 18, 'Yes', 'Yes', 'No', 19, 4, 2016, 'Equipped with the tachyon device, Barry believes he is fast enough to stop Zoom and wants to open the breaches to catch him. Harry strongly advises against that plan but after Barry convinces him, Harry reveals that Cisco has the power to re-open the breach. Meanwhile, Hunter Zoloman\'s painful story on Earth-2 is revealed.', 'Y', 'N', 8.3),
	('The Flash', 'Back To Normal', 2, 19, 'Yes', 'Yes', 'No', 26, 4, 2016, 'A meta-human with super strength named Griffin Grey mistakes Harry for Earth-1 Harrison Wells and kidnaps him, demanding that Wells cure him from his current condition. Realizing another brilliant Wells could help track Griffin\'s location, Barry asks Jesse to help. Meanwhile, Wally corners Joe about The Flash.', 'Y', 'N', 7.7),
	('The Flash', 'Rupture', 2, 20, 'Yes', 'Yes', 'No', 3, 5, 2016, 'Zoom arrives back on Earth-1 intent on taking over Central City. Barry and Wells come up with a plan to stop Zoom once and for all but it\'s extremely dangerous. Unsure if he should take the risk, Barry reaches out to both fathers for advice. Henry is adamantly opposed to Barry risking his life again but Joe thinks he can handle it which puts the two men at odds with each other. Meanwhile, Cisco is shocked when he vibes the Earth-2 villain Rupture, who happens to be his brother Dante\'s doppelganger. Rupture came to this Earth seeking justice for Reverb\'s death. Iris decides she\'s finally ready to open up to Barry about her feelings for him.', 'Y', 'N', 9.1),
	('The Flash', 'The Runaway Dinosaur', 2, 21, 'Yes', 'Yes', 'No', 10, 5, 2016, 'With Barry gone, the team must figure out a way to handle the return of an old enemy - Girder. Realizing Girder is retracing his steps from his last attack, Iris volunteers to act as bait to trap him in S.T.A.R. Labs. Meanwhile, Barry fights to return to his old life.', 'Y', 'N', 8.9),
	('The Flash', 'Invincible', 2, 22, 'Yes', 'Yes', 'No', 17, 5, 2016, 'After Zoom unleashes an army of Earth-2 meta-humans on Central City, Barry is shaken when he sees their leader is the Black Canarys Earth-2 doppelganger, the Black Siren. Meanwhile, Wally takes to the streets to help The Flash stop the meta-humans, which worries Joe. Iris and Henry are concerned about Barry taking on Zoom.', 'Y', 'N', 9.1),
	('The Flash', 'The Race Of His Life', 2, 23, 'Yes', 'Yes', 'No', 24, 5, 2016, 'Barry vows to stop Zoom after learning Zoom\'s true plans.', 'Y', 'N', 9.2),
	('The Flash', 'Flashpoint', 3, 1, 'Yes', 'Yes', 'No', 4, 10, 2016, 'Barry is living his dream life  his parents are alive, hes asked Iris West on a date and he can finally be a normal guy as Central City has another speedster, Kid Flash, running around saving the city. When Barry starts forgetting parts of his old life, the Reverse Flash taunts his nemesis and tells him that there will be serious repercussions for Barry and the ones he loves if he continues to live in this alternate universe. In addition to losing his memories, his powers will also start to fade. When disaster strikes, Barry must decide if he wants to continue to live in this world as Barry Allen or return to his universe as The Flash. ', 'N', 'N', 8.7),
	('The Flash', 'Paradox', 3, 2, 'Yes', 'Yes', 'No', 11, 10, 2016, 'Barry realizes the effects from Flashpoint are much greater than he thought. Barry meets new co-worker Julian Albert and is surprised by Julians immediate disdain for Barry. ', 'N', 'N', 8.7),
	('The Flash', 'Magenta', 3, 3, 'Yes', 'Yes', 'No', 18, 10, 2016, 'Barry and Team Flash are thrilled to reunite with Earth-2 Wells and Jesse. Wells confides to Barry and Caitlin that Jesse has all the powers of a speedster and has been saving people on his Earth. He is concerned about her safety and wants them to talk her out of using her powers. Magenta, a new meta who can control metal, terrorizes the city.', 'N', 'N', 8.1),
	('The Flash', 'The New Rogues', 3, 4, 'Yes', 'Yes', 'No', 25, 10, 2016, 'Barry continues to train Jesse and when a new meta human, Mirror Master, appears on the scene he lets her tag along. Mirror Master has teamed up with his old partner, Top, and is looking for Snart to even a score. Jesse is quick to join the chase but defies one of Barry\'s orders which results in disastrous consequences.', 'N', 'N', 8.5),
	('The Flash', 'Monster', 3, 5, 'Yes', 'Yes', 'No', 1, 11, 2016, 'Desperate to understand what is happening to her, Caitlin visits her mother, Dr. Tannhauser, a renowned biomedical researcher, in the hopes that her mother can provide some answers about Caitlin\'s growing meta-human powers. However, when Dr. Tannhauser treats her daughter like a test subject, Caitlin grows cold and brings up past wounds causing the two to have a major blowout. After a mysterious new meta-human attacks Central City, Barry tries to convince Julian to let him assist on the case.', 'N', 'N', 7.9),
	('The Flash', 'Shade', 3, 6, 'Yes', 'Yes', 'No', 15, 11, 2016, 'When Wally starts having dreams about being Kid Flash, Barry realizes he has to tell Wally, Iris and Joe about what happened to Wally in Flashpoint in order to keep him safe.', 'N', 'N', 8.8),
	('The Flash', 'Killer Frost', 3, 7, 'Yes', 'Yes', 'No', 22, 11, 2016, 'Caitlin uses her powers to save Barry but as her mother predicted, the effort unleashes her inner Killer Frost. Killer Frost goes on a rampage looking for Dr. Alchemy, kidnapping Julian and battling both The Flash and Vibe. Joe and H.R. have a heart to heart talk.', 'N', 'N', 9),
	('The Flash', 'Invasion', 3, 8, 'Yes', 'Yes', 'No', 29, 11, 2016, 'When aliens called the Dominators attack Central City, Barry speeds over to Star City to ask the Green Arrow for help in stopping them. Realizing the battle against the Dominators is bigger than they thought, they track down the Legends of Tomorrow, and Barry and Cisco create a breach to bring back a secret weapon  Supergirl. Once all of the super friends are assembled, they come up with a plan to attack but a shocking secret related to Flashpoint is revealed and suddenly no one is sure who they can trust. Meanwhile, Wally wants to join the battle against the aliens but Iris tells him hes not ready. ', 'N', 'N', 9.3),
	('The Flash', 'The Present', 3, 9, 'Yes', 'Yes', 'No', 6, 12, 2016, 'With Alchemy and Savitar still looming threats, Barry is unable to focus on the Christmas holiday, and especially his relationship with Iris. Determined to stop Savitar, Barry goes to Earth-3 to get advice from Jay Garrick. Wally wants to help Barry fight Savitar and reveals that hes been training with H.R, which doesnt go over well with Barry. As Cisco faces his first Christmas without his brother Dante, old wounds are reopened. ', 'N', 'N', 9.1),
	('The Flash', 'Borrowing Problems From The Future', 3, 10, 'Yes', 'Yes', 'No', 24, 1, 2017, 'Barry is tormented by his vision of the future where Iris is murdered by Savitar. When a criminal named Plunder shows up in Central City, Barry recalls the villains presence in his vision of the future and fears that if he catches Plunder, it will cement Iris fate. Confused about Barrys hesitation to stop Plunder, Wally decides to step in as Kid Flash. Caitlin offers Julian a job. ', 'N', 'N', 8.4),
	('The Flash', 'Dead Or Alive', 3, 11, 'Yes', 'Yes', 'No', 31, 1, 2017, 'H.R.s past catches up with him when a bounty hunter with vibe powers named Gypsy arrives in Central City to bring him back to Earth-19 to stand trial for his crime. It turns out inter-dimensional travel is illegal on their Earth. H.R. surrenders but when Barry and Cisco find out that H.R.s only hope would be to challenge Gypsy to a fight to the death, they intercede and Cisco offers to fight Gypsy instead. ', 'N', 'N', 8.2),
	('The Flash', 'Untouchable', 3, 12, 'Yes', 'Yes', 'No', 7, 2, 2017, 'Barry and the team at S.T.A.R. Labs work together to bring down Clive Yorkin, a criminal meta-human who is methodically killing people by causing them to decompose at an accelerated rate. Joe becomes his next target but its Iris who is caught in the crossfire. The Flash mentors Kid Flash and begins to elevate the newer speedsters training to another level. ', 'N', 'N', 8.2),
	('The Flash', 'Attack On Gorilla City', 3, 13, 'Yes', 'Yes', 'No', 21, 2, 2017, 'Barry, Caitlin, Cisco, and Julian voyage to Earth-2 on a rescue mission to save Harry from Gorilla City. As they trek through the forest, Barry and the team are immediately captured and taken to Grodd. Grodd tells them he needs their help to stop Solovar, the leader of Gorilla City, as Solovar wants to invade Earth-1. Back on Earth-1, Jesse and Kid Flash protect Central City and talk about their future.', 'N', 'N', 8.3),
	('The Flash', 'Attack On Central City', 3, 14, 'Yes', 'Yes', 'No', 28, 2, 2017, 'When Grodd and his army of gorillas bring the battle to Earth-1, The Flash and team must find a way to stop them before they destroy Central City. Gypsy returns to join the fight. Jesse Quick decides she wants to stay with Wally on Earth-1. ', 'N', 'N', 8.2),
	('The Flash', 'The Wrath Of Savitar', 3, 15, 'Yes', 'Yes', 'No', 7, 3, 2017, 'While training with Barry, Wally starts to have visions of Savitar, which he hides from the team. A dangerous secret threatens Barry and Iris happiness.', 'N', 'N', 9),
	('The Flash', 'Into The Speed Force', 3, 16, 'Yes', 'Yes', 'No', 14, 3, 2017, 'Desperate to stop Savitar and save his friends, Barry turns to the speed force for answers. H.R. gives Jesse some advice. ', 'N', 'N', 8.3),
	('The Flash', 'Duet', 3, 17, 'Yes', 'Yes', 'No', 21, 3, 2017, 'Barry and team are surprised when Mon-El and Hank Henshaw arrive on their Earth carrying a comatose Supergirl who was whammied by the Music Meister. Unable to wake her up, they turn to Team Flash to save her. However, the Music Meister surprises The Flash and puts him in a similar coma, one that Team Flash can\'t cure. Kara and Barry wake up without their powers in an alternate reality where life is like a musical and the only way to escape is by following the script, complete with singing and dancing, to the end. ', 'N', 'N', 6),
	('The Flash', 'Abra Kadabra', 3, 18, 'Yes', 'Yes', 'No', 28, 3, 2017, 'The Flash battles Abra Kadabra, a villain from Earth-19, who makes him a tempting offer  release him and Abra Kadara will reveal Savitars true identity. Desperate to save Iris, Barry considers taking the deal but Gypsy breaches in to capture the villain for her own reasons and during the melee, Abra Kadabra manages to escape. Barry is furious that Gypsy interfered but Gypsy refuses to back down, forcing Cisco to take sides. Julian is still a bit cold towards Caitlin but when she is severely injured in a battle with Gypsy, he rushes to her side. ', 'N', 'N', 8.4),
	('The Flash', 'The Once And Future Flash', 3, 19, 'Yes', 'Yes', 'No', 25, 4, 2017, 'Barry travels to the future to find out Savitars still unknown identity in the hopes of saving Iris. Upon his arrival in 2024, Barry encounters future versions of his Team Flash friends, who, following the death of Iris, have become very different people, profoundly impacted by their showdown with Savitar. It will be up to Barry to infuse a sense of hope back into the team, as he proves to be hero his future friends have been waiting for. Meanwhile, back in 2017, the hunt for Killer Frost continues.', 'N', 'N', 9),
	('The Flash', 'I Know Who You Are', 3, 20, 'Yes', 'Yes', 'No', 2, 5, 2017, 'Barry and the team meet Tracy Brand, a scientist, who may be the key to stopping Savitar. Unfortunately, Killer Frost is also after Tracy so Team Flash must battle their old friend, which proves to be particularly difficult for Cisco. Joe and Ceciles relationship takes a big turn. ', 'N', 'N', 9.2),
	('The Flash', 'Cause And Effect', 3, 21, 'Yes', 'Yes', 'No', 9, 5, 2017, 'Barry takes drastic measures to stop Savitar. Meanwhile, H.R. continues to push Tracy Brand to design the trap for Savitar and Killer Frost returns with an interesting proposal.', 'N', 'N', 8.5),
	('The Flash', 'Infantino Street', 3, 22, 'Yes', 'Yes', 'No', 16, 5, 2017, 'With only 24 hours left until Savitar murders Iris, Barry struggles to save the woman he loves and makes the choice to use any means necessary to do so. Realizing he has one option left to save her, The Flash turns to Captain Cold for help.  ', 'N', 'N', 9.4),
	('The Flash', 'Finish Line', 3, 23, 'Yes', 'Yes', 'No', 23, 5, 2017, 'With nothing left to lose, Barry takes on Savitar in an epic conclusion to season three.', 'N', 'N', 9.1),
	('The IT Crowd', 'Yesterday\'s Jam', 1, 1, 'Yes', 'Yes', 'Yes', 3, 2, 2006, 'Jen is hired as the manager Reynholm Industries although she doesn\'t know the first thing about computers.', 'Y', 'N', 7.8),
	('The IT Crowd', 'Calamity Jen', 1, 2, 'Yes', 'Yes', 'Yes', 3, 2, 2006, 'Denholm declares war on stress and threatens to fire anyone who is under stress by the end of the day. Will the team hold it together by the end of the day so no one gets fired?', 'Y', 'N', 8.3),
	('The IT Crowd', 'Fifty-Fifty', 1, 3, 'Yes', 'Yes', 'Yes', 10, 2, 2006, 'Love is in the air with the IT Crowd! Roy has a wonderful date, only to learn that he had something nasty on his forehead the whole time. Jen fancies the security guard and tries to impress him by guessing the answers to questions on classical music. Roy\'s decides that women only like bastards. Jen disagrees, so to settle the argument, Roy puts a fake profile up on an online dating site. Roy and Moss create a horrible online profile, only it works a little too well.', 'Y', 'N', 8),
	('The IT Crowd', 'The Red Door', 1, 4, 'Yes', 'Yes', 'Yes', 17, 2, 2006, 'Moss learns that his new mug with his name on it has gone missing. Roy refuses to allow Jen to see what\'s behind the \'red door\' for fear that Jen will upset the delicate eco-balance of the office. But Roy and Moss go on an IT call, leaving the Red Door unguarded.', 'Y', 'N', 8),
	('The IT Crowd', 'The Haunting Of Bill Crouse', 1, 5, 'Yes', 'Yes', 'Yes', 24, 2, 2006, 'Jen has a date with Bill Crouse, and finds him really offensive. To help Jen avoid contact with Bill, Moss resorts to extreme lying which leads everyone to believe that Jen is dead! Meanwhile, Roy finds himself trying to escape the attentions of one of the \'beautiful people\' on the 5th floor.', 'Y', 'N', 8.5),
	('The IT Crowd', 'Aunt Irma Visits', 1, 6, 'Yes', 'Yes', 'Yes', 3, 3, 2006, 'Jen explains to Roy and Moss that her \'Aunt Irma\' is visiting. When they don\'t understand, she explains that she has very powerful mood swings around a certain time every month, which leads to Roy and Moss displaying the same symptoms. Project Iccarus is finished and all of the teams assemble before Denholm as he thanks everyone even remotely associated with the project - except for the IT Crowd. To retaliate in being left out of the the \'thank you\'s,\' the IT Crowd decide to sabotage the celebration party only to find themselves enjoying in the festivities and to the bizarre conclusion the morning after. Will everyone be able to work together again?', 'Y', 'N', 8.2),
	('The IT Crowd', 'The Work Outing', 2, 1, 'Yes', 'Yes', 'Yes', 24, 8, 2007, 'Dashing Philip drops in from the sixth floor to ask Jen to the theatre, but a possible date turns into a work outing when Moss and Roy also get invites. The evening predictably spirals towards disaster, leaving Jen to wonder whether Philip is who he claims to be.', 'Y', 'N', 9.4),
	('The IT Crowd', 'Return Of The Golden Child', 2, 2, 'Yes', 'Yes', 'Yes', 31, 8, 2007, 'Denholm is informed of a police presence at the office, causing him to commit suicide. Roy asks Moss to \'pimp\' the vibrate setting on his mobile phone because it is so weak, and then is mortified to find an internet site that predicts his date of death to be 3pm on the date of Denholm\'s funeral. Despite reassurances from Moss and Jen, he cannot help but worry. Denholm\'s successor then reveals he despises the IT department and would love to see them fired. At the funeral, Roy causes a scene as his mobile phone vibrates heavily, believing he is dying. Denolm\'s successor threatens to fire Moss, Roy and Jen, but Denholm\'s estranged son and natural successor to Reynholm Industries, Douglas, bursts into the funeral and takes over the company. It turns out that he loves the IT department, and their jobs are saved. Jen takes up smoking again after watching Denholm advertise them on his funeral video.', 'Y', 'N', 8.2),
	('The IT Crowd', 'Moss And The German', 2, 3, 'Yes', 'Yes', 'Yes', 7, 9, 2007, 'Worried that his life is stagnating, Moss enrols on a German cookery course. Jen discovers that the only place in the building where she can now enjoy a cigarette is a smoking area not unlike Soviet Russia.', 'Y', 'N', 8.3),
	('The IT Crowd', 'The Dinner Party', 2, 4, 'Yes', 'Yes', 'Yes', 14, 9, 2007, 'Jen has found love, and is giving a dinner party with her new boyfriend to six of their single friends. But when the three male invitees drop out at the last moment, Jen is forced to call upon Moss, Roy and Richmond.', 'Y', 'N', 8.6),
	('The IT Crowd', 'Smoke And Mirrors', 2, 5, 'Yes', 'Yes', 'Yes', 21, 9, 2007, 'When Jen loses concentration during a board meeting due to a faulty bra, Moss overcomes his fear of ladies\' underwear and plots a way out of Reynholm Industries by inventing a flawless bra.', 'Y', 'N', 7.9),
	('The IT Crowd', 'Men Without Women', 2, 6, 'Yes', 'Yes', 'Yes', 28, 9, 2007, 'Douglas hires Jen as his new PA, which gives Moss and Roy free reign in the office.', 'Y', 'N', 7.7),
	('The IT Crowd', 'From Hell', 3, 1, 'Yes', 'Yes', 'Yes', 21, 11, 2008, 'Jen has to handle a difficult builder and Roy loses a 20, while Moss learns how to stand up for himself against a bunch of ruffians.', 'Y', 'N', 7.8),
	('The IT Crowd', 'Are We Not Men', 3, 2, 'Yes', 'Yes', 'Yes', 28, 11, 2008, 'Roy and Moss become involved on a new football website. Jen dates a man who resembles a magician.', 'Y', 'N', 8.4),
	('The IT Crowd', 'Tramps Like Us', 3, 3, 'Yes', 'Yes', 'Yes', 5, 12, 2008, 'When a sexual harrassment case ends wrongly - Roy turns to the streets, Moss gets a bump on the head, and Jen is looking for something new to do.', 'Y', 'N', 8.1),
	('The IT Crowd', 'The Speech', 3, 4, 'Yes', 'Yes', 'Yes', 12, 12, 2008, 'Jen makes enemies of Roy and Moss after trying to assert herself more after being named as Employee of the Month. Douglas discovers that the woman who he loves is not quite as she seems.', 'Y', 'N', 9),
	('The IT Crowd', 'Friendface', 3, 5, 'Yes', 'Yes', 'Yes', 19, 12, 2008, 'The boys are introduced to a social networking website by Jen.', 'Y', 'N', 8.5),
	('The IT Crowd', 'Calendar Geeks', 3, 6, 'Yes', 'Yes', 'Yes', 26, 12, 2008, 'The company announces that it is going to have its first raunchy nude calendar.', 'Y', 'N', 7.8),
	('The IT Crowd', 'Jen The Fredo', 4, 1, 'Yes', 'Yes', 'Yes', 25, 6, 2010, 'Jen decides she wants to stretch herself more at work and applies for the post of Entertainment Manager. After she discovers that her boss\'s business connections have a dark side, she turns to Moss and Roy for help.', 'Y', 'N', 8.1),
	('The IT Crowd', 'The Final Countdown', 4, 2, 'Yes', 'Yes', 'Yes', 2, 7, 2010, 'Moss becomes a celebrity after he beats all the records on a popular puzzle show. Roy is mistaken for a window cleaner. Jen finds herself pre-occupied with Douglas\' secret meetings.', 'Y', 'N', 8.3),
	('The IT Crowd', 'Something Happened', 4, 3, 'Yes', 'Yes', 'Yes', 9, 7, 2010, 'Douglas finds himself becoming a Spaceologist. Some bad luck changes Roy\'s life. Jen ends up getting involved with a rock band.', 'Y', 'N', 7.5),
	('The IT Crowd', 'Italian For Beginners', 4, 4, 'Yes', 'Yes', 'Yes', 16, 7, 2010, 'Roy gets obsessed by his latest girlfriend\'s sad family history, while Jen tells an absolute whopper to get some attention.', 'Y', 'N', 8.2),
	('The IT Crowd', 'Bad Boys', 4, 5, 'Yes', 'Yes', 'Yes', 23, 7, 2010, 'Roy and Moss opt to try a new lifestyle which they soon realize was probably a bad idea when they dodge work.', 'Y', 'N', 8.3),
	('The IT Crowd', 'Reynholm Vs Reynholm', 4, 6, 'Yes', 'Yes', 'Yes', 30, 7, 2010, 'Douglas discovers that marriage agrees with him for all of a fortnight. He then finds himself in court defending himself with Jen, Roy and Moss\' help.', 'Y', 'N', 7.6),
	('The Last Man On Earth', 'Alive In Tucson', 1, 1, 'Yes', 'Yes', 'No', 1, 3, 2015, 'He has traveled to every city, every town and every outpost in the United States, Mexico and Canada, and has found no one. As he returns to his hometown of Tucson, Phil comes to the realization that he is almost certainly the last living being on the face of the earth.', 'Y', 'N', 8.2),
