	('The Last Man On Earth', 'Raisin Balls And Wedding Bells', 1, 3, 'Yes', 'Yes', 'No', 8, 3, 2015, 'While Carol puts lots of thought and care into her wedding, Phil does his best to pretend like it is not happening.', 'Y', 'N', 7.8),
	('The Last Man On Earth', 'Sweet Melissa', 1, 4, 'Yes', 'Yes', 'No', 15, 3, 2015, 'Phil and Carol are shocked to find Melissa, another survivor, just after Phil reluctantly agreed to marry Carol.', 'Y', 'N', 7.7),
	('The Last Man On Earth', 'Dunk The Skunk', 1, 5, 'Yes', 'Yes', 'No', 22, 3, 2015, 'Re-population is the talk of Tucson as Phil navigates the choppy waters between Carol and Melissa.', 'Y', 'N', 7.4),
	('The Last Man On Earth', 'Some Friggin\' Fat Guy', 1, 6, 'Yes', 'Yes', 'No', 22, 3, 2015, 'The discovery of a fourth survivor further complicates things for Phil.', 'Y', 'N', 7.3),
	('The Last Man On Earth', 'She Drives Me Crazy', 1, 7, 'Yes', 'Yes', 'No', 29, 3, 2015, 'Todd and Melissa drive Phil crazy with their constant love-making and cutesy behavior. Meanwhile, the community comes together and votes to force Phil to clean his toilet pool.', 'Y', 'N', 7.2),
	('The Last Man On Earth', 'Mooovin\' In', 1, 8, 'Yes', 'Yes', 'No', 29, 3, 2015, 'Despite Carol nagging him, Todd\'s happiness, and Melissa\'s complete disinterest, Phil makes a discovery that is going to change the game. Literally.', 'Y', 'N', 6.9),
	('The Last Man On Earth', 'The Do-Over', 1, 9, 'Yes', 'Yes', 'No', 12, 4, 2015, 'With Carol now living in Phil\'s house and reorganizing his entire life, he asks God for a \'do-over\' on his entire life, and unfortunately, he gets one.', 'Y', 'N', 7.6),
	('The Last Man On Earth', 'Pranks For Nothin\'', 1, 10, 'Yes', 'Yes', 'No', 12, 4, 2015, 'Once Phil fails to convince everyone that his running off with Gail and Erica was a prank, he chooses a much different and entirely unexpected strategy.', 'Y', 'N', 7.6),
	('The Last Man On Earth', 'Moved To Tampa', 1, 11, 'Yes', 'Yes', 'No', 19, 4, 2015, 'Phil attempts to alter his \'Alive in Tucson\' signs so no more men will show up, but he ends up marooned on one of his billboards with no one to help.', 'Y', 'N', 7.9),
