	('The Last Man On Earth', 'Is There Anybody Out There', 2, 1, 'Yes', 'Yes', 'No', 27, 9, 2015, 'Phil and Carol leave Tucson behind and strike out on their own in a road trip across the United States.', 'Y', 'N', 8.2),
	('The Last Man On Earth', 'The Boo', 2, 2, 'Yes', 'Yes', 'No', 4, 10, 2015, 'Phil searches desperately for Carol after they\'re separated without phones or walkie-talkies.', 'Y', 'N', 7.9),
