	('The Last Man On Earth', 'C To The T', 2, 4, 'Yes', 'Yes', 'No', 18, 10, 2015, 'Phil/Tandy finds redemption when he saves the day.', 'Y', 'N', 7.5),
	('The Last Man On Earth', 'Crickets', 2, 5, 'Yes', 'Yes', 'No', 25, 10, 2015, 'The population may be small, but it\'s still big enough for big, dark secrets.', 'Y', 'N', 7.7),
	('The Last Man On Earth', 'A Real Live Wire', 2, 6, 'Yes', 'Yes', 'No', 8, 11, 2015, 'Tandy and Todd attempt to solve an end-of-the-world power problem.', 'Y', 'N', 7.6),
	('The Last Man On Earth', 'Baby Steps', 2, 7, 'Yes', 'Yes', 'No', 15, 11, 2015, 'Re-population becomes a hot topic with the Malibu survivors.', 'Y', 'N', 7.5),
	('The Last Man On Earth', 'No Bull', 2, 8, 'Yes', 'Yes', 'No', 22, 11, 2015, 'Phil 2 finds himself on Tandy\'s level when he causes problems with the group.', 'Y', 'N', 7.7),
	('The Last Man On Earth', 'Secret Santa', 2, 9, 'Yes', 'Yes', 'No', 6, 12, 2015, 'Along with most human life, the virus wiped out normal traditions and holidays. As Christmas approaches, Carol spearheads a \'Secret Santa\' gift exchange to spread some festive cheer.', 'Y', 'N', 8.1),
	('The Last Man On Earth', 'Silent Night', 2, 10, 'Yes', 'Yes', 'No', 13, 12, 2015, 'The pressure is on as Gail tries to fix a bad situation, and Melissa and Todd try to recover from their relationship troubles.', 'Y', 'N', 8.5),
	('The Last Man On Earth', 'Pitch Black', 2, 11, 'Yes', 'Yes', 'No', 6, 3, 2016, 'Mike Miller\'s space capsule careening through the sky toward Earth, finally putting him on the same planet as his big brother, Phil. Mike thinks he is the last man on earth, but who knows what or whom he might encounter.', 'Y', 'N', 8.2),
	('The Last Man On Earth', 'Valhalla', 2, 12, 'Yes', 'Yes', 'No', 13, 3, 2016, 'The Malibu gang seeks closure after Phil 2\'s demise, while Todd and Melissa maneuver through the aftermath of her surprise proposal.', 'Y', 'N', 7.3),
