	('The Last Man On Earth', 'Falling Slowly', 2, 16, 'Yes', 'Yes', 'No', 24, 4, 2016, 'Todd has a lot to think about when Tandy and Carol ask a major favor of him. Meanwhile, Gail\'s wine consumption has become an issue.', 'Y', 'N', 7.7),
	('The Last Man On Earth', 'Smart And Stupid', 2, 17, 'Yes', 'Yes', 'No', 8, 5, 2016, 'Todd feels left out, as Tandy warms to having his big brother back on Earth. Meanwhile, Mike learns more about Erica than the group has ever uncovered about her.', 'Y', 'N', 8.2),
	('The Last Man On Earth', '30 Years Of Science Down The Tubes', 2, 18, 'Yes', 'Yes', 'No', 15, 5, 2016, 'Phil and Mike grow closer than ever and the whole Malibu group gets a big friggin\' surprise.', 'Y', 'N', 8.4),
	('The Last Man On Earth', 'General Breast Theme With Cobras', 3, 1, 'Yes', 'Yes', 'No', 25, 9, 2016, 'The safety of Tandy and the group is in jeopardy as armed intruders storm the Malibu beach near their home, and no one can agree on what to do. While Melissa takes drastic action, Tandy gets a new lesson in fashion.', 'N', 'N', 7.8),
	('The Last Man On Earth', 'The Wild Guess Express', 3, 2, 'Yes', 'Yes', 'No', 2, 10, 2016, 'When Todd suffers from major remorse over recent actions, Tandy tries to lift his best friends spirits  even if it requires a few white lies.', 'N', 'N', 7.6),
