	('The Last Man On Earth', 'The Power Of Power', 3, 5, 'Yes', 'Yes', 'No', 6, 11, 2016, 'The group continues to search for a new place to live, but someone may be sabotaging their progress. Meanwhile, the love triangle between Todd, Gail and Melissa hits new road blocks.', 'N', 'N', 7.3),
	('The Last Man On Earth', 'The Open Ended Nature Of Unwitnessed Death', 3, 6, 'Yes', 'Yes', 'No', 13, 11, 2016, 'Tandy attempts to develop his new friendship with Lewis by learning about his past. Meanwhile, Carol asks Gail for a big favor and Todd addresses Melissa\'s mental state head-on.', 'N', 'N', 8.1),
	('The Last Man On Earth', 'Mama\'s Hideaway', 3, 7, 'Yes', 'Yes', 'No', 20, 11, 2016, 'Carol is hell-bent on capturing the perfect family photo and will stop at nothing to get it. Meanwhile, Melissa has a surprising mission of her own, Lewis looks into a new hobby and Gail finds herself stuck in a scary situation.', 'N', 'N', 7.1),
	('The Last Man On Earth', 'Whitney Houston, We Have a Problem', 3, 8, 'Yes', 'Yes', 'No', 4, 12, 2016, 'After finding a mysterious note left by Melissa that says \'Goodby\', the gang sets off to go look for her. Meanwhile, Gail gets stuck on a solo adventure of her own.', 'N', 'N', 7.2),
	('The Last Man On Earth', 'If You\'re Happy And You Know It', 3, 9, 'Yes', 'Yes', 'No', 11, 12, 2016, 'Carol is bummed about Gail\'s absence, so Tandy tries to cheer her up with the honeymoon vacation they never had. Meanwhile, Lewis finds new success with his pursuits in aviation and Melissa is contained.', 'N', 'N', 7.6),
	('The Last Man On Earth', 'Got Milk', 3, 10, 'Yes', 'Yes', 'No', 5, 3, 2017, 'The first moments of the deadly virus outbreak are revealed through a special lens.', 'N', 'N', 8.4),
	('The Last Man On Earth', 'The Spirit Of St. Lewis', 3, 11, 'Yes', 'Yes', 'No', 12, 3, 2017, 'After being locked up for her own safety, Melissa plays hurtful mind games with the group. Meanwhile, Todd and the group explore medications that might help her, and Lewis goes on a new solo adventure.', 'N', 'N', 7.6),
	('The Last Man On Earth', 'Hair Of The Dog', 3, 12, 'Yes', 'Yes', 'No', 19, 3, 2017, 'Todd and Tandy dig deep into Melissa\'s pre-virus past, as they search for answers about her illness, and Carol adopts a new outlook on life.', 'N', 'N', 7.3),
	('The Last Man On Earth', 'Find This Thing We Need To', 3, 13, 'Yes', 'Yes', 'No', 26, 3, 2017, 'Carol makes a big discovery, enlisting Tandy and Erica to help her track down some answers. Meanwhile, Todd has a major breakthrough with Melissa.', 'N', 'N', 7.3),
	('The Last Man On Earth', 'Point Person Knows Best', 3, 14, 'Yes', 'Yes', 'No', 2, 4, 2017, 'Tandy tries to take charge of a new situation that has unfolded in the group, and Carol is suspicious of Todd\'s behavior', 'N', 'N', 6.5),
	('The Last Man On Earth', 'Name 20 Picnics Now!', 3, 15, 'Yes', 'Yes', 'No', 23, 4, 2017, 'The gang has one huge celebration to cover every major holiday; Tandy and Todd\'s relationship hits a rough patch.', 'N', 'N', 6.7),
	('The Last Man On Earth', 'The Big Day', 3, 16, 'Yes', 'Yes', 'No', 30, 4, 2017, 'Tandy and Gail face off in a major disagreement, on which the whole group must weigh in, and Carol is forced to choose a side. Meanwhile, Melissa, Todd and Erica each have major milestone moments.', 'N', 'N', 7),
	('The Last Man On Earth', 'When The Going Gets Tough', 3, 17, 'Yes', 'Yes', 'No', 7, 5, 2017, 'The long term consequences of surviving an apocalypse start to have a major impact on the group, whose daily life is upended.', 'N', 'N', 8.1),
	('The Last Man On Earth', 'Nature\'s Horchata', 3, 18, 'Yes', 'Yes', 'No', 7, 5, 2017, 'The long term consequences of surviving an apocalypse start to have a major impact on the group, whose daily life is upended.', 'N', 'N', 7.7),
	('The Newsroom', 'We Just Decided To', 1, 1, 'Yes', 'Yes', 'Yes', 24, 6, 2012, '\'News Night\' anchor Will McAvoy returns to work after a public meltdown to find most of his staff has jumped ship, but new hires help steer the show when news of a catastrophe breaks in the spring of 2010.', 'Y', 'N', 9),
	('The Newsroom', 'News Night 2.0', 1, 2, 'Yes', 'Yes', 'Yes', 1, 7, 2012, 'MacKenzie wants an economist to give a nightly financial report on \'News Night\'. Jim covers for Maggie\'s mistake; Charlie ends Reese\'s meetings with Will, and a breakup story is a secret no more.', 'Y', 'N', 8),
	('The Newsroom', 'The 112th Congress', 1, 3, 'Yes', 'Yes', 'Yes', 8, 7, 2012, 'Tea Party critiques draw the ire of network executives and CEO Leona Lansing. Don confronts Elliot about his analytical skills Jim helps Maggie during a panic attack and Mac is unnerved by Will\'s endless parade of romantic conquests.', 'Y', 'N', 8.4),
	('The Newsroom', 'I\'ll Try To Fix You', 1, 4, 'Yes', 'Yes', 'Yes', 15, 7, 2012, 'Will\'s mission attracts a tabloid\'s attention; Wade has information about the government\'s fight against white-collar crime; Maggie finds a date for Jim, and Sloan has trouble being a matchmaker.', 'Y', 'N', 9),
	('The Newsroom', 'Amen', 1, 5, 'Yes', 'Yes', 'Yes', 22, 7, 2012, 'Neal finds someone who can provide updates from Cairo as the staff strive to give equal attention to uprisings there and in Wisconson.', 'Y', 'N', 8.5),
	('The Newsroom', 'Bullies', 1, 6, 'Yes', 'Yes', 'Yes', 29, 7, 2012, 'Sloan harshly questions a Tokyo power-company representative during the Japanese earthquake nuclear crisis. Will learns a lesson about bullying after his rude behavior in an interview.', 'Y', 'N', 8.6),
	('The Newsroom', '5\'1', 1, 7, 'Yes', 'Yes', 'Yes', 5, 8, 2012, 'An anonymous source gives details on an imminent story of national importance. When the President calls a televised speech that night, the 2.0 staff cuts short its 1-year anniversary party and rushes back to the newsroom.', 'Y', 'N', 8.5),
	('The Newsroom', 'The Blackout - 1 - Tragedy Porn', 1, 8, 'Yes', 'Yes', 'Yes', 12, 8, 2012, 'Will and Mac abandon principles when ratings plummet. Sloan is irked by her lack of screen time. Charlie discovers a whistleblower\'s identity.', 'Y', 'N', 8.8),
	('The Newsroom', 'The Blackout - 2 - Mock Debate', 1, 9, 'Yes', 'Yes', 'Yes', 19, 8, 2012, 'The staff stages a mock debate. Mac has an epiphany. Lisa goes off-script during an interview. Neal goes under cover.', 'Y', 'N', 8.2),
	('The Newsroom', 'The Greater Fool', 1, 10, 'Yes', 'Yes', 'Yes', 26, 8, 2012, 'Sloan ponders a job offer while Neal\'s Internet alias could avert a calamity upon Will. Everything, however, is overshadowed by a showdown long in the making. It finally explodes as Will, Mac and Charlie confront Leona and Reese during a volatile lunch meeting. But Mac is still in the crosshairs of TMI gossip columnist Nina Howard as she tries to destroy Will\'s career and life by printing a bogus story. ', 'Y', 'N', 8.9),
	('The Newsroom', 'First Thing We Do, Let\'s Kill All The Lawyers', 2, 1, 'Yes', 'Yes', 'Yes', 14, 7, 2013, 'Will and the \'News Night\' staff are questioned by their lawyer about a story they\'ve aired that\'s become a network crisis. An on-air remark by Will has him pulled from 9/11 anniversary coverage. Jim volunteers to cover for an embed reporter on the Romney campaign and Neal investigates the beginnings of Occupy Wall Street.', 'Y', 'N', 8.2),
	('The Newsroom', 'The Genoa Tip', 2, 2, 'Yes', 'Yes', 'Yes', 21, 7, 2013, 'A tip on a story that will ultimately cripple the network starts to become more real. Mackenzie and Sloan continue to push Will on drones as Don urges Will to advocate for Troy Davis. Maggie is un-friended by her roommate, but gets the assignment she\'s been begging for. Neal gets arrested on Wall Street.', 'Y', 'N', 8.2),
	('The Newsroom', 'Willie Pete', 2, 3, 'Yes', 'Yes', 'Yes', 28, 7, 2013, 'Will continues his mission to civilize by telling Nina Howard the truth. A new witness to the Genoa story emerges on Twitter, and in New Hampshire, Jim\'s efforts to have his questions answered continue to fall on deaf ears.', 'Y', 'N', 8.2),
	('The Newsroom', 'Unintended Consequences', 2, 4, 'Yes', 'Yes', 'Yes', 4, 8, 2013, 'Maggie tries to convince Rebecca that she\'s fine following her shattering trip to Africa with Gary. An Occupy Wall Street protester with a Black Op lead refuses to cooperate with Neal and Jerry after an on-air interview with Will goes poorly. Jim lands Hallie a one-on-one, but gets heat from Mac as a result.', 'Y', 'N', 8.4),
	('The Newsroom', 'News Night With Will McAvoy', 2, 5, 'Yes', 'Yes', 'Yes', 11, 8, 2013, 'Will is distracted during his telecast by a phone call and an unflattering Twitter post. Charlie gets a visit from a longtime friend at the Office of Naval Intelligence, who has knowledge of Operation Genoa. Sloan phases from humiliation to rage following a revenge posting. The newsroom traverses the slippery slope separating fact from fiction.', 'Y', 'N', 8.3),
	('The Newsroom', 'One Step Too Many', 2, 6, 'Yes', 'Yes', 'Yes', 18, 8, 2013, 'Mac and Charlie score a key witness, a retired Marine general, in their attempt to corroborate Jerry\'s Operation Genoa story. Will follows Nina\'s lead to soften his image by making an impromptu appearance on a morning talk show. Jim gets unexpected company during his reunion with Hallie, who\'s in town to cover a Romney rally.', 'Y', 'N', 8.2),
	('The Newsroom', 'Red Team III', 2, 7, 'Yes', 'Yes', 'Yes', 25, 8, 2013, 'Through depositions with the newsroom staff, Rebecca pieces together the events that led to ACN\'s fateful decision to go forward with Jerry\'s special report on Operation Genoa as well as the post-air revelations that undermined its credibility. The repercussions threaten to ruin \'News Night\' while eclipsing breaking news during another 9/11 anniversary.', 'Y', 'N', 9.2),
	('The Newsroom', 'Election Night - 1', 2, 8, 'Yes', 'Yes', 'Yes', 8, 9, 2013, 'In the wake of Leona\'s refusal to accept the resignations of three top ACN talents, \'News Night\' goes forward with its 2012 election coverage, featuring Will in the unlikely role of director of morale. Sloan is perturbed that her book was auctioned off with a forged signature, while Mac tasks Neal to fix a faulty Wikipedia page. Mindful that Charlie wants a screw-up-free evening, Jim weighs the cons of retracting a call he made too soon. The team deliberates whether to hold off on a story that might affect a tight Senate race.', 'Y', 'N', 8.6),
	('The Newsroom', 'Election Night - 2', 2, 9, 'Yes', 'Yes', 'Yes', 15, 9, 2013, 'As Election Night 2012 winds down, Will and Charlie await a decision from Reese that may impact their future at ACN, and that of the entire senior staff. Sloan learns the identity of the anonymous winning bidder for her book; Don discusses a countersuit against Jerry with Rebecca; Neal turns to Hallie for help giving Mac a parting gift; Jim tries to make peace with Lisa, encouraging Maggie to do the same; Will has a revelation while Charlie is sharing his.', 'Y', 'N', 9.1),
	('The Newsroom', 'Boston', 3, 1, 'Yes', 'Yes', 'Yes', 9, 11, 2014, 'In the wake of the Genoa debacle, Will, Mac and the News Night team decide to err on the side of caution in reporting a major breaking story. Neal is contacted by an anonymous source in possession of stolen government documents revealing how false press stories planted in newspapers spawned fatal riots in Kundu. Sloan looks to solve a takeover puzzle. Maggie is forced to pinch-hit for Elliot in the aftermath of the Boston Marathon bombings.', 'Y', 'N', 8.8),
	('The Newsroom', 'Run', 3, 2, 'Yes', 'Yes', 'Yes', 16, 11, 2014, 'With Rebecca again tasked with defending ACN in a possible lawsuit, Will tries to protect Neal from the fallout over the DOD leak. Charlie and Leona enter the fray of a hostile-takeover gambit involving Reese\'s half-siblings. Sloan fears Don may be guilty of cashing in on insider information. Maggie ponders the ethics of eavesdropping. Hallie pays a price for a late-night tweet.', 'Y', 'N', 9.2),
	('The Newsroom', 'Main Justice', 3, 3, 'Yes', 'Yes', 'Yes', 23, 11, 2014, 'Leona and Reece look to raise cash in order to salvage ACN and thwart Blair and Randy. Will gets a surprise at the White House Correspondents\' Dinner. Charlie trades visions with her ACN suitor. Maggie\'s EPA scoop makes it to News Night. Sloan and Don try to keep their relationship a secret from a new HR veep.', 'Y', 'N', 8.8),
	('The Newsroom', 'Contempt', 3, 4, 'Yes', 'Yes', 'Yes', 30, 11, 2014, 'Facing a court subpoena and possible incarceration for contempt, Will stands firm in refusing to reveal the source of the stolen DOD documents. As Charlie\'s disdain for Lucas grows, Sloan and Mac scramble to find a more acceptable 11th-hour buyer for ACN. Jim\'s relationship with Hallie is put to the test by her new job at Carnivore, a start-up website.', 'Y', 'N', 9.1),
	('The Newsroom', 'Oh Shenandoah', 3, 5, 'Yes', 'Yes', 'Yes', 7, 12, 2014, 'Incarcerated for contempt, Will refuses to reveal the name of Neal\'s government source. Appearing to embrace Pruit\'s mandate to capture younger viewers, Charlie orders a reluctant Don to track down principals in a sexual-abuse case at an elite college. Sloan voices her objection to a new digital site built by Neal\'s replacement, Bree. Stranded in a Moscow airport, Jim and Maggie look to land seats for a Cuban-bound plane, hoping to interview one of its high-profile passengers.', 'Y', 'N', 9.4),
	('The Newsroom', 'What Kind Of Day Has It Been', 3, 6, 'Yes', 'Yes', 'Yes', 14, 12, 2014, 'A sudden death leads Will and Mac to ponder the milestones that transformed the newsroom, and look ahead towards ACN\'s uncertain future. Maggie lands a field-producer interview in Washington; Neal\'s digital site is shut down for repairs; Leona offers sage advice to Pruit.', 'Y', 'N', 9.1),
	('The Night Manager', 'Episode 1', 1, 1, 'Yes', 'Yes', 'Yes', 21, 2, 2016, 'Hotel night manager Jonathan Pine receives a plea for help from a well-connected guest. His actions draw him into the world of Richard Roper, a businessman and arms dealer.', 'N', 'N', 8.1),
	('The Night Manager', 'Episode 2', 1, 2, 'Yes', 'Yes', 'Yes', 28, 2, 2016, 'On the Mediterranean island of Mallorca, Ropers life of luxury and calm is shattered. Six months earlier, Burr continues her recruitment of Pine, sending him to Devon to build his cover story.', 'N', 'N', 8.2),
	('The Night Manager', 'Episode 3', 1, 3, 'Yes', 'Yes', 'Yes', 6, 3, 2016, 'While he continues to recuperate in Ropers villa, Pine starts to dig up secrets about the other members of the household. Meanwhile, Burr and Steadman seize on an opportunity to recruit a new asset.', 'N', 'N', 8.2),
	('The Night Manager', 'Episode 4', 1, 4, 'Yes', 'Yes', 'Yes', 13, 3, 2016, 'Roper welcomes Pine into his inner circle, leaving Corky out in the cold. Meanwhile, Burr has concerns for the safety of her source, when she suspects key information has been leaked to the River House.', 'N', 'N', 8.4),
	('The Night Manager', 'Episode 5', 1, 5, 'Yes', 'Yes', 'Yes', 20, 3, 2016, 'A suspicious Roper gathers his entourage around him in an attempt to root out the traitor, forcing Pine to play a dangerous game. In London, Burr and Steadman face mounting opposition from Whitehall.', 'N', 'N', 8.7),
	('The Night Manager', 'Episode 6', 1, 6, 'Yes', 'Yes', 'Yes', 27, 3, 2016, 'Roper and his team return to Cairo for the deal, reuniting Pine with an old enemy. Pine risks it all to put his plan in motion. A discredited Burr makes one last stand.', 'N', 'N', 8.6),
	('The West Wing', 'Pilot', 1, 1, 'Yes', 'Yes', 'No', 22, 9, 1999, 'In the series premiere, the White House staff is being called into work in the early hours of the morning to the news that the President of the United States has crashed his bicycle into a tree, much to the enjoyment of the press. The staff must run damage control on this and a gaffe by Deputy Chief of Staff Josh Lyman who, after provocation by Christian activist Mary Marsh on a televised debate, quips \'Lady, the God you pray to is too busy being indicted for tax fraud.\' Also, Deputy Communications Director Sam Seaborn meets and spends an evening with Laurie (Lisa Edelstein), not knowing she is a call girl, and then accidentally tells White House Chief of Staff Leo McGarry\'s daughter, Mallory O\'Brien, about it.', 'Y', 'N', 8.8),
	('The West Wing', 'Post Hoc, Ergo Propter Hoc', 1, 2, 'Yes', 'Yes', 'No', 29, 9, 1999, 'The Vice President refuses to fall in line with Bartlet; Sam discusses the problem of Laurie with Josh and Toby; the plane carrying President Bartlet\'s doctor, a naval officer, is shot down en route to Jordan; Bartlet hires Mandy as his consultant.', 'Y', 'N', 8.3),
	('The West Wing', 'A Proportional Response', 1, 3, 'Yes', 'Yes', 'No', 6, 10, 1999, 'Still enraged at Morris\'s death, Bartlet makes a show of deadly force; C.J. is upset about being kept out of the loop about Laurie; Josh hires Charlie to be Bartlet\'s new personal assistant.', 'Y', 'N', 8.7),
	('The West Wing', 'Five Votes Down', 1, 4, 'Yes', 'Yes', 'No', 13, 10, 1999, 'Five votes keep a very important gun-control bill from being passed and the staff has 72 hours to track down the errant congressmen.Toby is accused of manipulating the stock market by having a friend testify to Commerce on internet stocks. Leo\'s wife gets fed up with his long hours.', 'Y', 'N', 8.3),
	('The West Wing', 'The Crackpots And These Women', 1, 5, 'Yes', 'Yes', 'No', 20, 10, 1999, 'The staffers spend the day (Big Block of Cheese day) dealing with private organizations, aka the crackpots. Throughout the day, Sam deals with a UFO nut, CJ gets a proposal to build a wolves-only road, Toby and Bartlet clash over everything, and Josh is overwhelmed by guilt regarding his sister\'s death.', 'Y', 'N', 8.8),
	('The West Wing', 'Mr. Willis Of Ohio', 1, 6, 'Yes', 'Yes', 'No', 3, 11, 1999, 'Toby and Mandy push for a commerce bill with a census-counting provision, with three votes as the deciding factor; Sam tutors C.J. on the finer points of the census; Josh & Sam take Charlie out for a beer and are joined by Zoey and Mallory. Zoey faces a potentially dangerous situation when she goes out for the evening.', 'Y', 'N', 8.8),
	('The West Wing', 'The State Dinner', 1, 7, 'Yes', 'Yes', 'No', 10, 11, 1999, 'The president of Indonesia is honored at a state dinner; the staff deals with Hurricane Sarah, a potential teamster strike, and a raid involving children in Idaho; a reporter flirts with C.J.', 'Y', 'N', 8.4),
	('The West Wing', 'Enemies', 1, 8, 'Yes', 'Yes', 'No', 17, 11, 1999, 'Bartlet and Hoynes argue in front of the Cabinet. C.J. fends off Danny\'s advances when she suspects he\'s after a big story. Mallory asks Sam out, the staff leaps hurdles to pass a banking bill.', 'Y', 'N', 8.2),
	('The West Wing', 'The Short List', 1, 9, 'Yes', 'Yes', 'No', 24, 11, 1999, 'Bartlet struggles to name a nominee to the Supreme Court when the perfect nominee turns out to be not so perfect; A congressman attacks the staff, claiming that 1 in 3 use drugs.', 'Y', 'N', 8.7),
	('The West Wing', 'In Excelsis Deo', 1, 10, 'Yes', 'Yes', 'No', 15, 12, 1999, 'Toby tries to arrange a proper funeral for a homeless veteran; Josh and Sam try to set up a preemptive strike against Lillienfield, who is attacking Leo because of his prior drug and alcohol problem; CJ tries to get the staff to revisit the hate crimes issue; Bartlet sneaks out to do some last minute shopping.', 'Y', 'N', 9.1),
	('The West Wing', 'Lord John Marbury', 1, 11, 'Yes', 'Yes', 'No', 5, 1, 2000, 'War breaks out between India and Pakistan and Bartlet consults with Lord John Marbury. Toby accuses C.J. of being too friendly with the press when she objects to being kept in the dark, the staff realizes that Lillienfield\'s efforts to bring down Leo are going to get ugly when Josh gets a subpoena.', 'Y', 'N', 8.3),
	('The West Wing', 'He Shall, From Time To Time', 1, 12, 'Yes', 'Yes', 'No', 12, 1, 2000, 'Bartlet collapses before his first State of the Union address. Leo publicly admits to his former alcoholism and drug abuse, things get interesting romantically for both Sam and C.J. Lord John Marbury helps the staff negotiate an agreement between India and Pakistan.', 'Y', 'N', 8.7),
	('The West Wing', 'Take Out The Trash Day', 1, 13, 'Yes', 'Yes', 'No', 26, 1, 2000, 'Josh and Sam are able to make a bargain to keep Leo from going through a hearing, at the expense of a new sex education report. Mandy doesn\'t think a couple should be present at the signing of a new hate crimes bill instigated by the death of their son. Toby contends with some of PBS\'s detractors.', 'Y', 'N', 8.6),
	('The West Wing', 'Take This Sabbath Day', 1, 14, 'Yes', 'Yes', 'No', 9, 2, 2000, 'After the Supreme Court refuses to stay the execution of a convicted murderer, Bartlet has forty-eight hours to decide whether or not to commute the sentence; Josh faces off with Joey Lucas about his staff\'s not backing her candidate as vigorously as she\'d like.', 'Y', 'N', 8.9),
	('The West Wing', 'Celestial Navigation', 1, 15, 'Yes', 'Yes', 'No', 16, 2, 2000, 'Toby and Sam travel to Connecticut to get Roberto Mendoza released from jail. Josh must run a press briefing when C.J. has an emergency root canal.', 'Y', 'N', 9),
	('The West Wing', '20 Hours In L.A.', 1, 16, 'Yes', 'Yes', 'No', 23, 2, 2000, 'Bartlet and the senior staff fly to California to attend an important fundraiser. Hoynes must decide whether he will support Bartlet\'s stance or go with his convictions when the Senate is deadlocked on an ethanol tax bill.', 'Y', 'N', 8.1),
	('The West Wing', 'The White House Pro-Am', 1, 17, 'Yes', 'Yes', 'No', 22, 3, 2000, 'Abbey keeps the staff busy with the fallout when she leaks her personal preference for a Federal Reserve Board appointment and discusses child labor on a talk show, prompting a Congresswoman to offer an amendment which could shoot down the entire international tariff bill; Charlie\'s date with Zoey is cancelled because of threats by a white supremacist group.', 'Y', 'N', 7.9),
	('The West Wing', 'Six Meetings Before Lunch', 1, 18, 'Yes', 'Yes', 'No', 5, 4, 2000, 'Mendoza is confirmed by the Senate; Mandy needs Toby\'s help to replace a dead panda bear; Sam angers Mallory when she reads a position paper that he wrote supporting school vouchers; Josh meets with Jeff Breckenridge, who is irritating certain Congressmen with his stance on slavery reparations.', 'Y', 'N', 8.3),
	('The West Wing', 'Let Bartlet Be Bartlet', 1, 19, 'Yes', 'Yes', 'No', 26, 4, 2000, 'Mandy\'s old memo about Bartlet administration weaknesses surfaces. Josh tries to get administration nominees appointed to the Federal Elections Committee. Sam works to get a better policy on gays in the military.', 'Y', 'N', 9),
	('The West Wing', 'Mandatory Minimums', 1, 20, 'Yes', 'Yes', 'No', 3, 5, 2000, 'Andrea Wyatt insists that mandatory minimums be added to a new drug policy the staff is developing. C.J. makes a mistake and sets them back.', 'Y', 'N', 8.4),
	('The West Wing', 'Lies, Damn Lies And Statistics', 1, 21, 'Yes', 'Yes', 'No', 10, 5, 2000, 'Bartlet gets closer to making the FEC campaign finance reform-friendly, but his opponents strike back by making Sam\'s former dalliance with the call girl public knowledge; CJ waits anxiously for the administration\'s approval rating.', 'Y', 'N', 8.7),
	('The West Wing', 'What Kind Of Day Has It Been', 1, 22, 'Yes', 'Yes', 'No', 17, 5, 2000, 'The staff deals with the crisis of an American pilot who was shot down in Iraq. Toby\'s brother is in danger on a space shuttle whose doors won\'t close. Bartlet and the senior staff walk into trouble as they leave a town meeting.', 'Y', 'N', 9.2),
	('The West Wing', 'In The Shadow Of Two Gunmen - 1', 2, 1, 'Yes', 'Yes', 'No', 4, 10, 2000, 'While the staff awaits news regarding the injuries to Jed and Josh,  they recall how Josh, Sam, and Toby became involved in the campaign three years earlier; Leo, Toby, and C.J. deal with inquiries on Secret Service protection policies, as well as the absence of executive authority while Jed was in surgery.', 'Y', 'N', 9.4),
	('The West Wing', 'In The Shadow Of Two Gunmen - 2', 2, 2, 'Yes', 'Yes', 'No', 4, 10, 2000, 'With the accomplice in custody, it\'s revealed that the intended target was Charlie, not Bartlet.  The staff still awaits news about Josh, and recalls how C.J. and Donna came to join the Bartlet campaign.', 'Y', 'N', 9.3),
	('The West Wing', 'The Midterms', 2, 3, 'Yes', 'Yes', 'No', 18, 10, 2000, 'While Josh recovers from bullet wounds there\'s a noticeable tension among some of the White House Staff. Toby is gung-ho to go after extremist groups in light of the attack. Charlie withdraws from the first family after learning more about the shooting. Bartlet\'s mind is preoccupied with a small time school election because of an old rivalry. CJ mangles physicist by referring to them as psychics as Josh listens from his sick bed. A subplot involves a reception for radio talk show hosts. Dr. Jenna Jacobs, whose doctorate is in English Lit., is one of those attending. Sam encourages a friend to run for office, unfortunately it doesn\'t go as he intended.', 'Y', 'N', 8.4),
	('The West Wing', 'In This White House', 2, 4, 'Yes', 'Yes', 'No', 25, 10, 2000, 'To investigate the cost and availability of AIDS medication needed in Africa, the White House plays host to representatives of American pharmaceutical companies and the president of an African nation; C.J. accidentally leaks information to a freshman reporter; after Sam is shown up by an amateur Republican operative on a television program, Jed decides to hire her.', 'Y', 'N', 8.7),
	('The West Wing', 'And It\'s Surely To Their Credit', 2, 5, 'Yes', 'Yes', 'No', 1, 11, 2000, 'Leo tries to make Ainsley\'s arrival as painless as possible, despite resistance from her new boss and several other White House staffers; Donna helps with the President\'s weekly radio address; C.J. tries to derail a retiring General\'s attempt to speak out against Bartlet; Sam gives Josh ideas on how to deal with his insurance company.', 'Y', 'N', 8.4),
	('The West Wing', 'The Lame Duck Congress', 2, 6, 'Yes', 'Yes', 'No', 8, 11, 2000, 'The president considers recalling the Senate to push ratification of a nuclear-test-ban treaty. Meanwhile, Donna lobbies new legislation introducing ergonomic standards in the White House; A Ukrainian politician shows up at the White House drunk demanding to see the president.', 'Y', 'N', 7.8),
	('The West Wing', 'The Portland Trip', 2, 7, 'Yes', 'Yes', 'No', 15, 11, 2000, 'After ridiculing Notre Dame, C.J. is forced to accompany the President on a trip to Oregon; Toby and Sam struggle to write Jed\'s education speech for the following day; back at the White House, Josh tries to dissuade a gay Congressman who supports legislation banning same-sex marriages and Leo gets divorce papers, which causes Margaret to worry that he may fall off the wagon.', 'Y', 'N', 7.9),
	('The West Wing', 'Shibboleth', 2, 8, 'Yes', 'Yes', 'No', 22, 11, 2000, 'Toby encourages the President to appoint Leo\'s controversial sister to a national education post, against Leo\'s objections; Bartlet must decide what the do with 83 Chinese citizens who stowed away on a freighter ship and seek asylum on the grounds of religious persecution; CJ has to decide which one of two turkeys the President should \'pardon\' but then tries to save the other from the chopping block; Charlie is tasked with buying the President a new carving knife which is not as easy as it sounds.', 'Y', 'N', 8.5),
	('The West Wing', 'Galileo', 2, 9, 'Yes', 'Yes', 'No', 29, 11, 2000, 'On the eve of Jed\'s participation in a national television conference with thousands of school children as the Galileo probe arrives at Mars, NASA loses the communication link; Leo contends with a Russian ambassador who denies that a fire has broken out in a nuclear missile silo; C.J. and Sam accompany Jed to a concert where they\'re each faced with people they\'d rather not see; Josh and Donna work on the nomination for the next person to appear on a postage stamp; C.J. wrangles a minor controversy ignited by a leak that Jed doesn\'t like green beans.', 'Y', 'N', 8.3),
	('The West Wing', 'Noel', 2, 10, 'Yes', 'Yes', 'No', 20, 12, 2000, 'Josh investigates the suicide of a pilot with whom he has things in common; Donna tries to get an invitation to the Congressional Christmas party to hear Yo-Yo Ma perform; Jed insists on signing a mountain of Christmas cards himself; after a White House visitor has a strange reaction to a painting, C.J. sets out to discover its provenance; following weeks of volatile behavior and an outburst in the Oval Office, Josh meets with representatives from the America Trauma Victims Association and finally deals with the trauma from his shooting.', 'Y', 'N', 9.4),
	('The West Wing', 'The Leadership Breakfast', 2, 11, 'Yes', 'Yes', 'No', 10, 1, 2001, 'To get real issues to be discussed at a bi-partisan breakfast, Toby makes a deal with a former acquaintance who is the majority leader\'s new Chief of Staff to strike a bargain and put an issue on the agenda, thereby undermining CJ and setting up the administration to ridicule; The possibility of moving the press corps across the street is briefly explored; Leo and Toby start to face harsh realities about Bartlet\'s re-election; Josh and Sam build a fire with unfortunate consequences; Leo tells Josh to apologize for him after embarrassing himself in front of a columnist.  Unfortunately the embarrassment continues with Sam and Donna.', 'Y', 'N', 8.1),
	('The West Wing', 'The Drop-In', 2, 12, 'Yes', 'Yes', 'No', 24, 1, 2001, 'Bartlet has the duty of formally welcoming newly appointed ambassadors from other nations; Leo continues his efforts to get the President to support the \'missile shield: defense system\', even though the shield doesn\'t quite work; CJ must ask a popular comedian to turn down an offer to host the Will Rogers dinner; Sam is angered when Toby adds a \'drop-in\' to Sam\'s already perfect speech without consulting him.', 'Y', 'N', 7.9),
	('The West Wing', 'Bartlet\'s Third State Of The Union', 2, 13, 'Yes', 'Yes', 'No', 7, 2, 2001, 'The President delivers his 3rd State of the Union address, what critics call \'the speech of his political career\' and ends up angering Abbey by what he does and doesn\'t say; Josh must work the polling center with Joey Lucas, but a power outage delays the results; Sam attempts to introduce Ainsley to the President with disastrous results; CJ must juggle a live recording of the show \'Capitol Beat\' being broadcast within the White House and run damage control when a cop has a (possibly undeserved) black mark on his record; Leo and Bartlet must handle the matter of five DEA officials who are taken hostage by Columbian terrorists.', 'Y', 'N', 8.4),
	('The West Wing', 'The War At Home', 2, 14, 'Yes', 'Yes', 'No', 14, 2, 2001, 'Bartlet authorizes a special ops team to rescue the five DEA agents only to have them caught in an ambush; CJ arranges for the host of \'Capitol Beat\' to have an exclusive interview with the wronged police officer; Toby must deal with Senator Gilette who threatens to make a third party run for president due to the tone of the changes on social security reform; Sam gives Ainsley another chance to meet the President, but she still fails to create a good impression; Josh finally gets the poll results from Joey; Abbey and Bartlet discuss his running for a second term.', 'Y', 'N', 8.4),
	('The West Wing', 'Ellie', 2, 15, 'Yes', 'Yes', 'No', 21, 2, 2001, 'During an online chat, the Surgeon General comments favorably on the legalization of marijuana. The controversy heightens when Ellie Bartlet tells a reporter that her father would never fire the Surgeon General.  Toby asks his ex-wife, a Congresswoman, for her help in strongly persuading Seth Gillette to participate in the Social Security panel.', 'Y', 'N', 8.3),
	('The West Wing', 'Somebody\'s Going To Emergency, Somebody\'s Going To Jail', 2, 16, 'Yes', 'Yes', 'No', 28, 2, 2001, 'It\'s Big Block of Cheese Day again. Toby meets with World Trade Organization protesters, and CJ meets with a group of cartographers who want the standards for maps changed to be a more accurate reflection of geographical and political reality. Donna asks Sam to look into granting a pardon for a friend\'s deceased grandfather. Bartlet is having problems selecting a site for his Presidential library.', 'Y', 'N', 8.7),
	('The West Wing', 'The Stackhouse Filibuster', 2, 17, 'Yes', 'Yes', 'No', 14, 3, 2001, 'The staff is blindsided when an elderly senator stages a Friday night filibuster to block their Family Wellness bill; Toby is confused when VP Hoynes, a strong supporter of the oil industry, volunteers to give a speech attacking the energy sector; CJ tries to locate a  valuable Egyptian cat goddess statue given to the President.', 'Y', 'N', 8.9),
	('The West Wing', '17 People', 2, 18, 'Yes', 'Yes', 'No', 4, 4, 2001, 'Toby, suspicious that there\'s something going on with the President, finds out about Bartlet\'s MS and informs Leo of the legal ramifications; Josh and Donna disagree about the date of their \'anniversary\'; Sam and Ainsley argue about the necessity of the ERA; staffers struggle to punch-up the speech the President will give at the White House Correspondents Dinner.', 'Y', 'N', 8.9),
	('The West Wing', 'Bad Moon Rising', 2, 19, 'Yes', 'Yes', 'No', 25, 4, 2001, 'Bartlet confers with Babish on the legal ramifications of his MS cover-up; Sam has a personal interest in an oil spill off the coast of Delaware; Josh and Donna argue about a loan to Mexico; Toby orders C.J. to flush out a leak in the White House staff, which is far from easy.', 'Y', 'N', 8.7),
	('The West Wing', 'The Fall\'s Gonna Kill You', 2, 20, 'Yes', 'Yes', 'No', 2, 5, 2001, 'Babish menacingly questions CJ and Abbey about their involvement in the MS cover-up while Josh asks Joey Lucas to create a hypothetical poll the gauge the public\'s reaction; Sam is happy with a projected smaller-than-expected budget surplus; Donna is the only one worried about a Chinese satellite hurling toward the Earth at 2,000 mph.', 'Y', 'N', 8.5),
	('The West Wing', '18th And Potomac', 2, 21, 'Yes', 'Yes', 'No', 9, 5, 2001, 'The staff prepares for the worst as they make arrangements for the public announcement of the President\'s condition; Sam and Babish grill Abbey about her medical treatment of the President\'s MS; a crisis erupts in Haiti; Josh deals with two Democratic senators who won\'t support the administration\'s suit against tobacco companies; Mrs. Landingham buys her first new car, with tragic consequences.', 'Y', 'N', 9),
	('The West Wing', 'Two Cathedrals', 2, 22, 'Yes', 'Yes', 'No', 16, 5, 2001, 'On the day of Mrs. Landingham\'s funeral, the staff deals with a Haitian presidential crisis and the law suit against the big tobacco companies, and Bartlet must decide about running for reelection.', 'Y', 'N', 9.7),
	('The West Wing', 'Manchester - 1', 3, 1, 'Yes', 'Yes', 'No', 10, 10, 2001, 'Bartlet\'s decision about Haiti falls under scrutiny. C.J. makes a horrible blunder in a press conference and is hounded about the president\'s health by reporters, the staff disagrees about whether Bartlet should apologize for not revealing his medical condition. Abbey is angry that Jed has decided to run for reelection.', 'Y', 'N', 8.3),
	('The West Wing', 'Manchester - 2', 3, 2, 'Yes', 'Yes', 'No', 17, 10, 2001, 'The senior staff clash with the consultants who are to work on Bartlet\'s reelection campaign. C.J. is concerned that the press senses the Bartlets\' marriage could be in trouble. Josh asks Leo to let him use his connection to postpone the FDA\'s drug announcement, the situation on Haiti comes to a head.', 'Y', 'N', 8.4),
	('The West Wing', 'Ways And Means', 3, 3, 'Yes', 'Yes', 'No', 24, 10, 2001, 'The Special Prosecutor sets his probe in motion. Sam and Bruno are concerned about the loyalty of a powerful labor leader. Toby and Josh are preoccupied with a congressional battle over the estate tax. Ainsley fixes up Donna with a Republican.', 'Y', 'N', 8.3),
	('The West Wing', 'On The Day Before', 3, 4, 'Yes', 'Yes', 'No', 31, 10, 2001, 'When Bartlet vetoes the \'death tax\', the staff must scramble to keep the veto from being overridden; Josh tries to smooth talk a promising governor who is considering running against the President; Charlie is urged to ask for immunity in his upcoming testimony.', 'Y', 'N', 7.9),
	('The West Wing', 'War Crimes', 3, 5, 'Yes', 'Yes', 'No', 7, 11, 2001, 'The President has a showdown. Donna lies when she appears before the Congressional committee investigating the President. Leo debates with an old friend about the US future stance regarding the war crimes tribunal. Sam tries to find the logic in a Congressman\'s proposed legislation to eliminate the penny.', 'Y', 'N', 8),
	('The West Wing', 'Gone Quiet', 3, 6, 'Yes', 'Yes', 'No', 14, 11, 2001, 'When an American spy submarine suddenly goes silent in hostile North Korea, Bartlet must decide whether to inform the enemy or attempt a secret rescue operation; Abbey learns her past malpractice suits might compromise Bartlet\'s criminal investigation; Toby meets with a representative from an appropriations committee who wants to funnel money away from Congress\'s funding of avant-garde artists.', 'Y', 'N', 8),
	('The West Wing', 'The Indians In The Lobby', 3, 7, 'Yes', 'Yes', 'No', 21, 11, 2001, 'Disgruntled that Abbey has decided that the Bartlet\'s will be spending the Thanksgiving holiday at Camp David instead of New Hampshire, Bartlet takes out his pique by boring everyone within earshot over his plans to cook Thanksgiving dinner, going so far as to call \'The Butterball Hotline\' to ask questions about cooking the stuffing. Josh works to expedite the return of a 13 year old Georgia boy whose parents sent him to Italy after he murdered his teacher. When Italy refuses to extradite the boy to a death penalty state, Josh makes a deal with the district attorney prosecuting the case, offering him unlimited financial backing for his reelection campaign in exchange for his not seeking the death penalty. Sam struggles with the revised OMB poverty level formula which will instantly create four million new poor people until Bruno finds a way to spin it to the administration\'s advantage. On Thanksgiving Eve, C.J. tries to find someone, anyone, from Interior to meet with two Stockbridge-Mu', 'Y', 'N', 8),
	('The West Wing', 'The Women Of Qumar', 3, 8, 'Yes', 'Yes', 'No', 28, 11, 2001, 'C.J. is outraged about an arms sale to secure an airbase lease with a Middle-Eastern country which perpetuates atrocities against its women. the staff anxiously awaits test results to determine the possibility of an outbreak of mad-cow disease. Josh debates a woman\'s group lobbyist over a treaty\'s wording concerning prostitution. Toby meets with veterans upset about a Pearl Harbor anniversary exhibition at the Smithsonian. Sam explores the idea of a national seat belt law after Bartlet is sued by a woman whose husband died in an automobile accident.', 'Y', 'N', 8.3),
	('The West Wing', 'Bartlet For America', 3, 9, 'Yes', 'Yes', 'No', 12, 12, 2001, 'The staff and the F.B.I. work to combat a threat to firebomb black churches in Tennessee on Christmas Eve; accompanied by Jordan, Leo  testifies before the House committee probing Bartlet\'s failure to disclose his M.S. during the presidential campaign; Sam and Josh try unsuccessfully to get Leo out of the line of fire of a Congressman on the committee intent on destroying Leo to advance his own political career; surprisingly, Leo receives a last minute reprieve  at the hands of the Majority Counsel and the committee Chair.', 'Y', 'N', 8),
	('The West Wing', 'H. Con-172', 3, 10, 'Yes', 'Yes', 'No', 9, 1, 2002, 'Majority Counsel Clifford Calley makes Leo an offer regarding the MS affair he wants very much to refuse. Josh looks for any excuse to see Amy Gardner, a fired White House. Charlie gives the President a present that touches him and troubles everyone else. photographer has written a tell-all book about the Administration that Sam wants to refute point by point', 'Y', 'N', 9.1),
	('The West Wing', '100,000 Airplanes', 3, 11, 'Yes', 'Yes', 'No', 16, 1, 2002, 'On State of the Union night, Sam is being trailed by a magazine reporter to whom he was once engaged; the President\' Congressional censure weighs heavily on staffers\' minds as they debate whether to include an anti-cancer initiative in the President\'s address; Josh can\'t get Amy Gardner to talk to him.', 'Y', 'N', 8.1),
	('The West Wing', 'The Two Bartlets', 3, 12, 'Yes', 'Yes', 'No', 30, 1, 2002, 'On the day of the Democratic Caucus, Bartlet, Toby and C.J. go to Iowa to kick off the presidential race, and disagree over Bartlet\'s making a statement about affirmative action. Back in Washington, Leo forces Josh to intercede with an old friend leading a protest against Navy arms testing at Vieques, Puerto Rico. Sam meets with Bob Engler again, who is now acting on behalf of two congressmen who want an inventory of Fort Knox because they believe that most of the gold bullion has been replaced with alien bodies recovered from Area 51 in Roswell, New Mexico. After Josh rebuffs her request, Donna seeks Sam\'s help in getting out of jury duty. Josh brings a little bit of Tahiti to his relationship with Amy Gardner.', 'Y', 'N', 8.2),
	('The West Wing', 'Night Five', 3, 13, 'Yes', 'Yes', 'No', 6, 2, 2002, 'Stanley Keyworth revisits the White House to uncover the reason Bartlet hasn\'t been able to sleep since the night of the Iowa caucus. C.J. enlists Leo\'s help in freeing a White House. Donna is offered a lucrative dot.com job by an old friend. Sam sparks an exchange on radical versus lipstick feminism when he comments on Ainsley\'s evening attire immediately after asking her to review language in Bartlet\'s U.N. address. reporter kidnapped while on assignment in the Congo. Toby and Andy joust over an upcoming presidential speech condemning Islamic fanaticism by name', 'Y', 'N', 8),
	('The West Wing', 'Hartsfield\'s Landing', 3, 14, 'Yes', 'Yes', 'No', 27, 2, 2002, 'On the day before the New Hampshire primary, Josh drafts Donna as his frontwoman to ensure that Bartlet wins the nation\'s first primary in the small town of Hartsfield\'s Landing; C.J. and Charlie play an ever-escalating game of practical jokes; Jed plays simultaneous chess games with Sam and Toby while he plays delicate diplomatic and military games with the Chinese government over Taiwan.', 'Y', 'N', 8.2),
	('The West Wing', 'Dead Irish Writers', 3, 15, 'Yes', 'Yes', 'No', 6, 3, 2002, 'Concern arises over the medical board\'s decision on Abbey\'s actions in treating Jed\'s M.S.  Sam tries to get a Senator he doesn\'t like to pass a bill for a super-conducter that he doesn\'t, Lord Marbury explains to Toby why a member of the IRA cannot be invited to the White House. Donna receives shocking news when the Secret Service won\'t give her clearance to attend Abbey\'s birthday party. even understand. Amy tries to influence Josh', 'Y', 'N', 8.4),
	('The West Wing', 'The U.S. Poet Laureate', 3, 16, 'Yes', 'Yes', 'No', 27, 3, 2002, 'Toby looks forward to meeting the new U.S. Poet Laureate; Jed fires the first salvo of his reelection campaign when he calls his likely opponent less than brilliant, and the national press just can\'t get enough of it; Ainsley gets promoted; Josh overreacts to posts on the message board of a website devoted to \'all things Josh\'.', 'Y', 'N', 8.3),
	('The West Wing', 'Stirred', 3, 17, 'Yes', 'Yes', 'No', 3, 4, 2002, 'Hoynes and Bartlet each make an unexpected announcement about Hoynes\' place on the ticket. fears of a terrorist attack arise when a truck carrying depleted uranium-fuel rods is involved in a head-on collision in an Idaho tunnel. Donna seeks a Presidential Proclamation to honor her high-school teacher/mentor who\'s retiring and Bartlet\'s insistence on helping Charlie with his tax return sparks a discussion on the true nature of a tax rebate.', 'Y', 'N', 8.1),
	('The West Wing', 'Enemies Foreign And Domestic', 3, 18, 'Yes', 'Yes', 'No', 1, 5, 2002, 'The revelation that a Russian company may be building a heavy water reactor in Iran puts Jed in a difficult position as he prepares to meet with the new Russian president. Jed orders the Secret Service to protect C.J. when she receives death threats after making a comment at a press conference about the deaths of Saudi girls Charlie ponders the mystery of a strangely out of context letter written to the President.', 'Y', 'N', 8.4),
	('The West Wing', 'The Black Vera Wang', 3, 19, 'Yes', 'Yes', 'No', 8, 5, 2001, 'Bartlet and the staff are on high alert when they receive reports of an impending attack on a military installation; Josh is furious when he discovers that a gift he passed on to Donna, who in turn passed in on to an unpaid intern, ends up for sale on eBay; C.J. takes her niece shopping for a prom dress while the threats on her life continue, and her stalker manages to get close to her despite the protection of the Secret Service.', 'Y', 'N', 8.4),
	('The West Wing', 'We Killed Yamamoto', 3, 20, 'Yes', 'Yes', 'No', 15, 5, 2002, 'While Jed, Leo and Fitzwallace grapple with terrorism and moral absolutes, Josh and Amy grapple with each other over a welfare-reform bill; Donna represents the White House at a North Dakota state-party caucus whose goal is to remove the word \'North\' from the state\'s name; Toby doesn\'t want Jed to attend a New York fund-raiser because Ritchie will be there; Charlie is assigned the responsibility of finding Jed a new secretary; C.J. discovers that Simon Donovan is a very straight shooter', 'Y', 'N', 8.3),
	('The West Wing', 'Posse Comitatus', 3, 21, 'Yes', 'Yes', 'No', 22, 5, 2002, 'Bartlet continues to struggle over the wisdom of assassinating the terrorist Qumari defense minister; after Ritchie declines to meet Bartlet, Sam and Toby play a dirty trick; as the search for Mrs. Landingham\'s replacement continues, Charlie finds the perfect candidate, who makes less than a stellar first impression on Bartlet; Josh\'s determination to pass a welfare bill costs Amy; as C.J.\'s stalker is finally captured, the night ends in tragedy.', 'Y', 'N', 8.4),
	('The West Wing', '20 Hours In America - 1', 4, 1, 'Yes', 'Yes', 'No', 25, 9, 2002, 'Toby, Josh, and Donna learn the hard way about the lack of accessible public transportation in the heartland when they spend a long day trying to get back to Washington after the motorcade leaves them behind during a campaign stop in Indiana; Bartlet interviews potential replacements for Mrs Landingham while C.J. tries to find someone to fill Simon\'s shoes as Anthony\'s Big Brother; the Ritchie campaign whips up a furor when Abbey claims to be \'just a wife and mother\'; Qumar reopens the Shareef investigation; and the Dow takes a dive.', 'Y', 'N', 8.8),
	('The West Wing', '20 Hours In America - 2', 4, 2, 'Yes', 'Yes', 'No', 25, 9, 2002, 'Donna teaches Toby and Josh an important lesson as their trek homeward continues. Sam staffs the President in Josh\'s absence and welcomes an old friend home. Bartlet hires a secretary and C.J. finds a Big Brother for Anthony, the situation in Qumar continues to escalate. Bartlet gets spooked by a photo op as the Dow continues its dive. and a pipe bomb kills 44 students at a Midwest university swim meet.', 'Y', 'N', 8.8),
	('The West Wing', 'College Kids', 4, 3, 'Yes', 'Yes', 'No', 2, 10, 2002, 'Bartlet decides he needs a lawyer when Qumar goes after Israel. Josh is disturbed to learn that Stackhouse might not endorse Bartlet, a comment Deborah made years ago comes back to haunt her during a security check.', 'Y', 'N', 8),
	('The West Wing', 'The Red Mass', 4, 4, 'Yes', 'Yes', 'No', 9, 10, 2002, 'Leo meets with the Israeli Foreign Minister to enlist Israel\'s assistance with the Shareef investigation,  but is ultimately foiled by the Qumari; the debate about the Ritchie debates rages on until the staff comes up with a brilliant tactic; Josh and Amy argue over whether Stackhouse is siphoning votes from Bartlet; Ritchie tries to bait Bartlet on needle exchange programs; Bartlet is faced with resolving an 11 day standoff with the KSU bombers in Iowa who are holding an injured child; Josh sends Donna undercover to a seminar held by one of Ritchie\'s advisors in an effort to expose the \'fortune cookie candidacy\'; Stackhouse comes to a momentous decision about his campaign and provides inspiration for Bartlet.', 'Y', 'N', 7.8),
	('The West Wing', 'Debate Camp', 4, 5, 'Yes', 'Yes', 'No', 16, 10, 2002, 'As the staff prepares for the presidential debates at a North Carolina conference center, a vexing question about a failed attorney-general nomination (amid charges of racial profiling) leads to flashbacks of the administration\'s first weeks in office. Back then, Toby\'s marriage to Andrea Wyatt was about to end; now Sam and Charlie are helping him in his effort to reconcile with her. Meanwhile, the Israeli Air Force weighs in on the Qumari matter, and Joey Lucas reports that the president is likely to lose New Hampshire.', 'Y', 'N', 8.3),
	('The West Wing', 'Game On', 4, 6, 'Yes', 'Yes', 'No', 30, 10, 2002, 'Bartlet, Leo, Josh, Sam and C.J. pull a practical joke on Toby; Sam\'s mission to end the Wilde campaign leads him to make a career-altering decision; Jordan backs up Leo as he deals with the Qumari; Toby continues to press his case with a resistant Andrea; and Bartlet cleans Ritchie\'s clock in their debate.', 'Y', 'N', 9),
	('The West Wing', 'Election Night', 4, 7, 'Yes', 'Yes', 'No', 6, 11, 2002, 'Election day finally arrives with the staff eagerly anticipating the outcome. Sam is increasingly concerned about the Wilde campaign in Orange County. Toby worries about the effect of Andy\'s pregnancy on the voters. Donna accidentally votes for Richie and tries to rectify the situation by trying to find someone who will vote-swap. Bartlet has some new health issues to worry about.', 'Y', 'N', 8.6),
	('The West Wing', 'Process Stories', 4, 8, 'Yes', 'Yes', 'No', 13, 11, 2002, 'The staff celebrates election night and encourages Sam to run for the seat in Orange County. Toby continues to worry about how Andrea\'s pregnancy will play politically for both of them, a coup develops in Venezuela. Jed and Abbey endure some interruptions at their private celebration.', 'Y', 'N', 7.9),
	('The West Wing', 'Swiss Diplomacy', 4, 9, 'Yes', 'Yes', 'No', 20, 11, 2002, 'The 15-year old son of an Iranian leader needs a heart transplant in the U.S. Problem is, the only man who could do it is an enemy of the Iranian government; The Senate minority leader threatens to thwart the President\'s legislative agenda when he believes that Hoynes is doing some political maneuvering for the next Presidential election; Toby offers a Congresswoman a Cabinet position but is forced to take back the offer.', 'Y', 'N', 7.7),
	('The West Wing', 'Arctic Radar', 4, 10, 'Yes', 'Yes', 'No', 27, 11, 2002, 'When a celebrated female fighter pilot is threatened with a dishonorable discharge for refusing to end her affair with an enlisted man, the staff, though full of opinions, agrees that the White House should not get involved; Donna asks Josh to find out if Jack Reese likes her, and is horrified to discover some of the anecdotes about her that Josh has shared with Jack; Sam heads out to California to begin his election campaign, and sends Will Bailey to the White House to help Toby with the inaugural address; despite the best efforts of Leo and Charlie to keep him out of it, Bartlet blows a gasket over complaints from U.N. diplomats about parking enforcement in New York City; and Josh takes issue with a temporary worker\'s choice in accessories.', 'Y', 'N', 7.9),
	('The West Wing', 'Holy Night', 4, 11, 'Yes', 'Yes', 'No', 11, 12, 2002, 'It\'s December 23, and the holiday brings several visitors to the White House: Zoey comes home with her new French boyfriend in tow; aided by Josh, Toby\'s father seeks a reconciliation; and Danny arrives bearing gifts of gold and a heads-up for C.J. about Shareef\'s death. Will moves into Sam\'s office at Toby\'s insistence, and is treated to some good-natured ribbing by the rest of the staff.  Bartlet and Leo try to exorcise their guilt about Shareef by adding eleventh hour funding to combat infant mortality in the federal budget, and promoting peace in the Mideast, respectively.', 'Y', 'N', 8.2),
	('The West Wing', 'Guns Not Butter', 4, 12, 'Yes', 'Yes', 'No', 8, 1, 2003, 'Josh, determined to make sure a foreign aid bill passes even though it\'s a hopeless cause, sends Donna out to track down a reluctant senator; in an attempt to impress Zoey\'s new boyfriend, Charlie unwittingly gets over his head with the Department of Defense; Danny continues to pursue the Shareef matter; a Bartlet photo op with Heifer International creates unexpected opportunities -- for C.J. to perfect her spin-doctoring techniques, and for the staff once again to test Will\'s mettle and sense of humor.', 'Y', 'N', 7.8),
	('The West Wing', 'The Long Goodbye', 4, 13, 'Yes', 'Yes', 'No', 15, 1, 2003, 'While Toby unsuccessfully attempts to fill her shoes in the briefing room, C.J. returns to Dayton, where she gives a speech at her high school reunion, reconnects with an old friend, and struggles with her father\'s worsening Alzheimer\'s.', 'Y', 'N', 7.4),
	('The West Wing', 'Inauguration', 4, 14, 'Yes', 'Yes', 'No', 5, 2, 2003, 'The staff wrangles with the State Department over language in the inaugural address; a genocidal war breaks out in Kundu, and Bartlet weighs his options as Will pushes for American military involvement based on Bartlet\'s statements in the past; the Chief Justice\'s increased propensity for writing opinions in verse causes concern about his competence; Bartlet keeps Charlie busy on the hunt for the perfect Bible for the inauguration; Donna becomes upset when Jack is transferred out of the White House and reassigned to Italy after getting caught in a squeeze play between the Oval Office and the Pentagon.', 'Y', 'N', 8),
	('The West Wing', 'Inauguration - Over There', 4, 15, 'Yes', 'Yes', 'No', 12, 2, 2003, 'Toby discovers that Will\'s frankness, stubbornness, and commitment to ideals is much like his own; Charlie remains on the hunt for an inaugural Bible; Bartlet and the staff continue to debate over sending American troops into Kundu to stop a genocidal war until Laurel and Hardy provide some needed inspiration; Bartlet appoints Will Deputy Communications Director; Donna takes one for Jack when a comment he thinks he is making off the record is included in a \'Post\' article by Danny\'s editor.', 'Y', 'N', 8.2),
	('The West Wing', 'The California 47th', 4, 16, 'Yes', 'Yes', 'No', 19, 2, 2003, 'Bartlet plays hardball to end the genocide in Kundu; after the entire speechwriting staff quits, Will is forced to rely on Elsie and some inexperienced interns to write tax policy remarks; the trip to California to help Sam\'s campaign gets off to a rocky start; Sam refuses to let Bartlet hold off the Democratic response to the Republican tax plan because it might hurt the campaign; Toby and Charlie get arrested coming to Andy\'s defense after a drunk accosts her; Bartlet fires Sam\'s campaign manager and replaces him with Toby.', 'Y', 'N', 8),
	('The West Wing', 'Red Haven\'s On Fire', 4, 17, 'Yes', 'Yes', 'No', 26, 2, 2003, 'While Toby and C.J. are in California working on Sam\'s campaign, Josh drops Abbey\'s agenda in favor of his own, Jed deals with a military hostage situation, and Will runs his intern writing staff ragged.', 'Y', 'N', 7.9),
	('The West Wing', 'Privateers', 4, 18, 'Yes', 'Yes', 'No', 26, 3, 2003, 'Toby\'s old friend approaches him ready to blow the whistle on his employer\'s violations of environmental laws; staff pranks abound on Amy\'s first day at the office; Abbey charges Amy with the task of convincing the President to threaten a veto on a foreign aid bill containing an abortion gag rule provision; claiming that Abbey\'s ancestor was a pirate rather than a privateer, a prominent member threatens to mount a boycott of the D.A.R. dinner at which Zoey will be inducted until Will, C.J. and Amy devise a plan to defuse the situation; at the behest of Jean Paul, Zoey sends Charlie a \'Dear John\' email, but Charlie refuses to accept the brushoff and declares his love for Zoey; Donna is less than thrilled when Josh assigns her the job of shadowing a possible security risk at Zoey\'s D.A.R. induction; Will takes one for the team in putting an environmental and political face on the destruction and deaths which resulted from the melting of an Alaskan glacier.', 'Y', 'N', 7.4),
	('The West Wing', 'Angel Maintenance', 4, 19, 'Yes', 'Yes', 'No', 2, 4, 2003, 'Air Force One is forced to keep aloft for almost 24 hours when an  indicator light leads the flight crew to believe that the landing gear isn\'t functioning properly; Bartlet and Will have a spirited discussion on Colombian recertification, which is ultimately rendered moot when Air Force One doesn\'t land on time; the Black Caucus plays hardball with the Oval Office to gain a Congressional debate on the merits of reinstating the draft; legislation to clean up Chesapeake Bay is sacrificed to partisan politics; Will is unsuccessful in hiding his fear of flying from C.J. and Charlie; deaths in Kundu continue to mount.', 'Y', 'N', 7.7),
	('The West Wing', 'Evidence Of Things Not Seen', 4, 20, 'Yes', 'Yes', 'No', 23, 4, 2003, 'The White House is locked down after a gunman on the street fires shots into the West Wing. Josh interviews a candidate to replace Ainsley Hayes. Bartlet negotiates for the return of a spy plane is forced down over Russia, the staff plays poker.', 'Y', 'N', 8.2),
	('The West Wing', 'Life On Mars', 4, 21, 'Yes', 'Yes', 'No', 30, 4, 2003, 'On his first day at work, Joe Quincy pieces together three news leaks and uncovers a scandal which forces Hoynes to resign.', 'Y', 'N', 8.7),
	('The West Wing', 'Commencement', 4, 22, 'Yes', 'Yes', 'No', 7, 5, 2003, 'Bartlet finally tells the staff the truth about the death of Shareef. Danny agrees to hold off on the story after five alleged terrorists go missing. Andy goes into labor after once again refusing Toby\'s marriage proposal. Zoey is kidnapped from a nightclub on the night of her college graduation.', 'Y', 'N', 9),
	('The West Wing', 'Twenty Five', 4, 23, 'Yes', 'Yes', 'No', 14, 5, 2003, 'When Bartlet learns that Zoey\'s kidnapping is the work of Qumari terrorists, he invokes the 25th amendment to diminish their leverage and eliminate any conflict of interest; since there\'s no Vice President, the power of the Presidency passes to Bartlet\'s chief political rival and the most powerful Republican in the country, the Speaker of the House, who immediately takes a very hard line; now that twins Huck and Molly have arrived, Toby wonders if he\'s capable of loving them enough.', 'Y', 'N', 9.2),
	('The West Wing', '7A WF 83429', 5, 1, 'Yes', 'Yes', 'No', 24, 9, 2003, 'As the search for Zoey continues, Walken takes a hard line against the kidnappers that could contribute to her death; Danny releases the Shareef story, and the revelation creates a rift that separates Jed from Abbey and Liz; tensions arise between Walken\'s staff and Bartlet\'s staff; the Democratic leadership in Congress assails Leo for allowing Jed to step aside; in retaliation for Shareef\'s death,  a movie theater in Turkey is bombed, and eighty people, including American soldiers, are killed.', 'Y', 'N', 8.6),
	('The West Wing', 'The Dogs Of War', 5, 2, 'Yes', 'Yes', 'No', 1, 10, 2003, 'Bombs drop on Qumar upon Walken\'s orders; as the hours pass without any word on Zoey\'s whereabouts, tensions increase within the Bartlet family; Walken and Leo clash after Josh\'s suspicion that the opposition is using Walken\'s tenure in the Oval Office to advance their agenda is confirmed; Andy takes the twins home; Leo inflicts a new intern from a prominent political family on an unwilling Josh; Jed\'s staff is less than thrilled when they learn who will succeed Walken as Speaker of the House; the search for a new Vice President  is accelerated; Zoey is rescued.', 'Y', 'N', 8.1),
	('The West Wing', 'Jefferson Lives', 5, 3, 'Yes', 'Yes', 'No', 8, 10, 2003, 'When he realizes that his first choice for Vice President faces an uphill fight for nomination, Jed nominates a congressman that none of the staff can get excited about; Josh is less than thrilled with  his new intern.', 'Y', 'N', 7.5),
	('The West Wing', 'Han', 5, 4, 'Yes', 'Yes', 'No', 22, 10, 2003, 'Josh fails to sway an unruly congressman who insists on voting against the administration on the vice presidential confirmation, but Ryan reaches out to get him to change his mind; Leo fears that the potential defection of a prominent North Korean pianist will jeopardize secret nuclear disarmament talks; Will and Toby are humiliated when an early draft of a speech outlining their struggle to laud Bob Russell\'s confirmation is erroneously substituted for the final version; Donna\'s aunt and uncle from Wisconsin pay a visit, testing Josh\'s ability to refrain from bad cheesehead jokes during their tour of the White House; the staff  struggles over how to language the state of the economy; fearing that the administration is drifting off-course, Toby wants to hand over more responsibilities to Will in order to focus on getting back to their core message.', 'Y', 'N', 7.8),
	('The West Wing', 'Constituency Of One', 5, 5, 'Yes', 'Yes', 'No', 29, 10, 2003, 'Will Bailey receives an offer to become Vice President Russell\'s top aide. Amy Parker does some skillful lobbying for domestic violence prevention which gets the wrath of Bartlett. A conservative democratic senator switches parties.', 'Y', 'N', 7.7),
	('The West Wing', 'Disaster Relief', 5, 6, 'Yes', 'Yes', 'No', 5, 11, 2003, 'The fallout on the Hill from Carrick\'s switch to the Republican party exiles Josh deep into a White House doghouse, so C.J. gives Donna some tips on how she can support him; Jed gets a harsh reality check from C.J. when he lingers too long in a small Oklahoma town devastated by a deadly tornado; in Jed\'s absence, Leo juggles an impending war between Albania and Greece, a visit from the German chancellor, a tussle over tax cuts, and an over-reaching Secretary of Defense; Josh and Toby are less than thrilled when Leo brings Angela on board to assume some of Josh\'s responsibilities.', 'Y', 'N', 7.7),
	('The West Wing', 'Separation Of Powers', 5, 7, 'Yes', 'Yes', 'No', 12, 11, 2003, 'As Chief Justice Ashland\'s health problems continue to mount, Joe Quincy, Ashland\'s former clerk, is pressed into service to persuade him to retire; as C.J. prepares Zoey for a sit-down interview about her kidnapping, Abbey reveals that her relationship with her husband is still strained; Jed refuses to be held hostage by the Republican in the budget negotiations.', 'Y', 'N', 8),
	('The West Wing', 'Shutdown', 5, 8, 'Yes', 'Yes', 'No', 19, 11, 2003, 'Jed\'s decision not to be held hostage by Haffley shuts down the federal government; unable to get through to Jed and fearing the worst, Leo calls in the reinforcements, and Abbey returns to Washington to deliver a message and provide her husband with a little perspective; after being benched from the staff meetings, Josh gets put back in the game by Jed and sets the stage for victory; disregarding the advice of more seasoned colleagues, Haffley makes a major misstep and loses his advantage over the White House; Jed and Haffley meet and reach an accord on the budget.', 'Y', 'N', 8.7),
	('The West Wing', 'Abu El Banat', 5, 9, 'Yes', 'Yes', 'No', 3, 12, 2003, 'The Bartet clan attempts to gather for a holiday dinner.  Jed must deal with a hostage situation in Sudan, an assisted suicide in Oregon, his son-in-law\'s yearn to run for the House of Representatives, and his grandson\'s want to spend time with his grandpa.  C.J. takes a stand on the assisted suicide because of her father\'s worsening condition.', 'Y', 'N', 7.7),
	('The West Wing', 'The Stormy Present', 5, 10, 'Yes', 'Yes', 'No', 7, 1, 2004, 'President Bartlet attends the funeral of a former president with other former presidents Glenallen Walken and D. Wire Newman, while monitoring a possible situation in Saudi Arabia. Josh Lyman mediates an argument between a representative from Connecticut and one from North Carolina who wants her state\'s copy of the Bill of Rights returned. CJ is concerned about a scientist\'s invention which could interfere with privacy.', 'Y', 'N', 7.6),
	('The West Wing', 'The Benign Prerogative', 5, 11, 'Yes', 'Yes', 'No', 14, 1, 2004, 'In the days leading up to the State of the Union address, Toby gets crucial voter feedback when he accompanies Joey as she mall-tests the speech around the nation; Jed and the staff wrestle with the issues of presidential pardons and mandatory minimums; Charlie dates an attractive woman who\'s not what she seems; Joey Lucas derails Josh\'s plans when she arrives at the White House carrying a surprise; Jed and Abbey reach out to an old friend on the eve of his ex-wife\'s remarriage.', 'Y', 'N', 7.7),
	('The West Wing', 'Slow News Day', 5, 12, 'Yes', 'Yes', 'No', 4, 2, 2004, 'Toby gets Jed\'s support to seize a controversial window of opportunity to save Social Security, but is hampered by Jed\'s mandate to keep the operation under wraps; desperate to feed the press corps beast on a glacially slow news day, C.J. meets with an attache to discuss cabbage imports, and has a little fun with a particularly dense reporter; Josh\'s brainstorm to help Will burnish Bob Russell\'s presentation problems and a persistent reporter endanger Toby\'s attempts to broker a deal on the Hill; Rina finds a friend in Donna, and Josh isn\'t too happy about it; Toby is saved from having to fall on his sword when Josh and Jed devise a plan to rescue his deal from certain disaster.', 'Y', 'N', 8),
	('The West Wing', 'The Warfare Of Genghis Khan', 5, 13, 'Yes', 'Yes', 'No', 11, 2, 2004, 'An unlikely party comes to the aid of the administration as it seeks  to discover the party responsible for nuclear testing in the Indian Ocean; Will is unhappy, but his boss doesn\'t seem to mind, when a request to beef up the Vice President\'s issue profile results in Toby\'s handing him boring, low-level minutae; Josh dismisses a NASA proposal for a manned Mars mission until an agency staffer shows him the error of his ways; a conservative talk show host makes a pathetic attempt to bait C.J. into appearing on his show.', 'Y', 'N', 7.9),
	('The West Wing', 'An Khe', 5, 14, 'Yes', 'Yes', 'No', 18, 2, 2004, 'When five navy E-2C Hawkeye crew members are stranded in North Korea, Bartlet orders a risky Navy Seal rescue attempt. C.J. agrees to one on one with a motormouth conservative talk show host', 'Y', 'N', 7.7),
	('The West Wing', 'Full Disclosure', 5, 15, 'Yes', 'Yes', 'No', 25, 2, 2004, 'He\'s back, Former VP John Hoynes, who resigned in sex scandal, makes a bid for political resurrection by trashing Barlet and Leo in a tell-all book. But it\'s C.J. who\'s taking the news the hardest,', 'Y', 'N', 7.7),
	('The West Wing', 'Eppur Si Muove', 5, 16, 'Yes', 'Yes', 'No', 3, 3, 2004, 'When a conservative Republican Congresswoman targets Ellie\'s research project in an effort to discredit Jed, Toby discovers that the source of the leak is uncomfortably close to home, and Will realizes that they\'ve all greatly underestimated his boss; Josh investigates the wisdom of a recess appointment as he tries to convince an old friend to be patient with the Sixth Circuit judicial nomination process and keep his hat in the ring; C.J. completely misreads Ben\'s intentions; Donna tracks down an AWOL Ryan; an opening is created on the Supreme Court;  in an effort to redefine Abbey\'s image with the press, C.J. sets her up to do a public service announcement with the Muppets, which inspires Ellie to stand up before the press in defense of scientific research unhampered by politics.', 'Y', 'N', 7.7),
	('The West Wing', 'The Supremes', 5, 17, 'Yes', 'Yes', 'No', 24, 3, 2004, 'Jed and the staff vet potential Supreme Court appointees. Toby and Andy don\'t see eye-to-eye on her fact-finding trip to the Middle East. Donna\'s parents are the unlikely inspiration for the resolution to the problems arising from the judicial confirmation process.', 'Y', 'N', 9.1),
	('The West Wing', 'Access', 5, 18, 'Yes', 'Yes', 'No', 31, 3, 2004, 'A documentary camera crew follows C.J. around for a not-so-typical day in the White House.', 'Y', 'N', 7.1),
	('The West Wing', 'Talking Points', 5, 19, 'Yes', 'Yes', 'No', 21, 4, 2004, 'Hail the conquering hero. Josh returns after nailing down details for a trade agreement. But the devil in the detail, including information kept from Josh. C.J. fights megamedia ownership of local TV.', 'Y', 'N', 7.7),
	('The West Wing', 'No Exit', 5, 20, 'Yes', 'Yes', 'No', 28, 4, 2004, 'An airborne contamination alert locks down the West Wing, forcing staffers to stay put until the all-clear is sounded; Toby and Will face off over Will\'s working for the vice president; C.J. tells Donna some things she\'s rather not hear about Josh and her career prospects; Leo confronts Abbey about the dangers of her recent coping mechanisms; Jed, Debbie, and Charlie are poked, prodded, and sent to the decontamination showers; Kate is initially reluctant to give Josh any information on a personal or professional level as they sit out the alert together.', 'Y', 'N', 8),
	('The West Wing', 'Gaza', 5, 21, 'Yes', 'Yes', 'No', 12, 5, 2004, 'Donna Moss, Percy Fitzwallace, Andrea Wyatt and a couple of congressmen are in the Middle East on a fact finding mission when their cars are blown up. President Bartlet considers possible military targets to bomb in retaliation. In flashbacks, we see Donna becoming attracted to British photojournalist Colin Ayres.', 'Y', 'N', 8.4),
	('The West Wing', 'Memorial Day', 5, 22, 'Yes', 'Yes', 'No', 19, 5, 2004, 'Jed weighs his options for responding to the bombing as Israeli and Palestinian forces face off against each other. Josh has an interesting reaction when Colin arrives at the hospital to visit Donna. Kate and Leo clash over the advice she\'s giving Jed. Josh assumes a diplomatic role when the Palestinians approach him to initiate settlement discussions. Toby and Charlie prepare a reluctant Jed for throwing out the first ball at Camden Yards. Donna\'s life is threatened when she develops a pulmonary embolism. Jed reflects on the days prior to his first inauguration.', 'Y', 'N', 8.3),
	('The West Wing', 'NSF Thurmont', 6, 1, 'Yes', 'Yes', 'No', 20, 10, 2004, 'As they remain at Donna\'s bedside while she recuperates from surgery to remove a pulmonary embolism, Colin questions Josh about his personal relationship with Donna.  When Bartlet and Leo clash over the appropriate response to the Gaza attack, Kate makes the case for a summit meeting, and provides Bartlet with the hook he needs to get the Israelis and Palestinians to sit down together at Camp David.', 'Y', 'N', 8.1),
	('The West Wing', 'The Birnam Wood', 6, 2, 'Yes', 'Yes', 'No', 27, 10, 2004, 'Bartlet orders a strike on the terrorist training camp as he and his staff broker a peace settlement between the Israelis and the Palestinians, but Bartlet and Leo realize that their differences over the peace settlement are irreconcilable, warranting a change in Leo\'s responsibilities.  Having returned from Germany, Josh expresses concern about Leo\'s well-being, and his observations turn out to be well founded.', 'Y', 'N', 8.4),
	('The West Wing', 'Third-Day Story', 6, 3, 'Yes', 'Yes', 'No', 3, 11, 2004, 'Leo is rushed into bypass surgery after suffering a massive heart attack; as Toby and Josh scramble chaotically to get votes after Haffley demands Democratic support for a tax cut in exchange for ratification of the peace plan, it becomes quickly apparent that Jed must overcome his reluctance to name a new chief of staff; C.J. works with the State Department on getting U.N. and NATO approval of the  peace accord; Charlie drags his feet about completing some minor graduation requirements because he\'s reluctant to keep his promise that he\'ll resign as Jed\'s body man to seek a better position once he has his degree; Donna returns to work; C.J. gets on Josh\'s case about his unhealthy diet.', 'Y', 'N', 8),
	('The West Wing', 'Liftoff', 6, 4, 'Yes', 'Yes', 'No', 10, 11, 2004, 'Margaret and Charlie prove to be invaluable allies as C.J. has a rough first day in her new position, made even more difficult by a Russian bearing radioactive gifts and a Defense Secretary\'s attempts to undermine her; Toby\'s less than stellar performance in the briefing room makes the search for a new press secretary a top priority, and Josh volunteers Donna to assist him in interviewing potential candidates; faced with a number of vulnerable seats in the upcoming election, Josh attempts to dissuade Matthew Santos from dropping out of another race for the House.', 'Y', 'N', 8.4),
	('The West Wing', 'The Hubbert Peak', 6, 5, 'Yes', 'Yes', 'No', 17, 11, 2004, 'Hours before the CAFE standards amendment is defeated,  Josh succumbs to the lure of test driving a monster SUV while shopping for a Prius and gets into a fender-bender that proves embarrassing to the administration, so he\'s saddled with heading up a task force on alternative energy sources; after hosting a surprise graduation party for Charlie, Zoey agrees to his taking her out to a thank-you dinner; Annabeth educates Toby on the art of \'charm and disarm\' in handling the press; Charlie is offered an attractive way out of his employment dilemma; Kate extents a hand of friendship and support to Donna; C.J. gets some crucial insight from Leo on keeping Jed healthy;  Margaret\'s plan to redecorate Leo\'s former office meets with resistance from her new boss.', 'Y', 'N', 7.6),
	('The West Wing', 'The Dover Test', 6, 6, 'Yes', 'Yes', 'No', 24, 11, 2004, 'The peace mission suffers its first American casualty, whose father is sharply critical of the administration; Santos breaks ranks with the party by signing onto Republican legislation for a patient bill of rights when his own bill dies in committee; Margaret searches for a new office for Charlie; Leo struggles to recover his health, his strength, and his appetite with the help of his nurse, who looks after both his body and his soul with wisdom and determination; Donna, out of her wheelchair and onto crutches, is besieged by the media for interviews; C.J. has harsh words for Toby when he lets his personal feelings take him off-message in the briefing room; Leo contemplates a post-recovery job offer in the private sector before his nurse reminds him why he left there in the first place; Will calls Josh out about the staff\'s disrespect for Russell\'s candidacy; as Annabeth finds a way to turn around a bad news cycle, Toby admonishes C.J. about micro-managing the press office.', 'Y', 'N', 7.6),
	('The West Wing', 'Change', 6, 7, 'Yes', 'Yes', 'No', 1, 12, 2004, 'Hoynes throws his hat in the presidential ring, and asks Josh to join his campaign; Jed\'s health begins to deteriorate; Toby and Kate head the protocol negotiations with the Chinese over the arrangements for the upcoming summit, which is jeopardized when Jed mistakenly accepts a Taiwanese flag at the National Prayer Breakfast; Bernard takes his new position as head of the Gifts Unit to heart as he gives Charlie a hard time about retrieving the flag so that it can be returned; Josh has his hands full with a pro-Taiwanese  senator holding a hard line on recognizing their independence; Bob Russell crashes an Oval Office photo op with the governor of Pennsylvania, who\'s also another potential presidential candidate.', 'Y', 'N', 7.7),
	('The West Wing', 'In The Room', 6, 8, 'Yes', 'Yes', 'No', 8, 12, 2004, 'Penn and Teller roll a lesson about the First Amendment into their entertainment at Zoey\'s White House birthday party, setting off a media frenzy and public relations nightmare; Baker drops out of the race, leaving the field free for Russell, who asks Josh to run his campaign; Jed takes a hard line on making significant gains on substantive issues in his last China summit; Vinick turns down Jed\'s offer of the U.N. ambassadorship to run for president; a fully ambulatory Donna has difficulty scheduling a meeting with Josh; Jed has an MS relapse which leaves him partially paralyzed and in a wheelchair.', 'Y', 'N', 8.4),
	('The West Wing', 'Impact Winter', 6, 9, 'Yes', 'Yes', 'No', 15, 12, 2004, 'As acting chief of staff, Josh calls Leo in for backup when the news about Jed\'s health hits; the staff follows the progress of an asteroid headed for earth; Jed struggles with his relapse as C.J., Kate, and Toby handle the repercussions of his illness on the progress of the China summit; Josh is outraged when Will uses Jed\'s paralysis as a political opportunity for Russell; Donna resorts to extreme measures when Josh avoids her repeated attempts to sit down for a personal discussion; after receiving some wise advice from Leo about the future, Josh makes a decision about the man he\'ll support in the upcoming presidential election.', 'Y', 'N', 8.5),
	('The West Wing', 'Faith Based Initiative', 6, 10, 'Yes', 'Yes', 'No', 5, 1, 2005, 'A senator attaches a rider to the federal budget bill that would ban gay marriage, almost daring the President to veto it, as the physical infirmities of Bartlet\'s MS become more pronounced. The Internet is rampant with a story that questions CJ\'s sexual orientation, and it is only fueled further when CJ refuses to dignify the allegations by putting out a statement. Donna joins the Vice President\'s senior staff, and heads for New Hampshire to start up Russell\'s presidential campaign there. And Santos decides that he will run for president after all, but only if Josh will leave the White House to manage his campaign.', 'Y', 'N', 8),
	('The West Wing', 'Opposition Research', 6, 11, 'Yes', 'Yes', 'No', 12, 1, 2005, 'Santos starts up his presidential campaign in New Hampshire, where he immediately disagrees with Josh on campaign philosophy: \'No opposition research, no dirt on our opponents.\'  Josh has an uncomfortable reunion with Russell campaign staffer Donna.', 'Y', 'N', 7.9),
	('The West Wing', '365 Days', 6, 12, 'Yes', 'Yes', 'No', 19, 1, 2005, 'On the day after Bartlet gives his last State of the Union address, Leo returns to the West Wing but has difficulty getting the attention of the rest of the staff for a meeting about what to do during the remaining 365 days of Barlet\'s term.  Kate and C.J. have to deal with emergencies in Bolivia and North Korea.  Charlie tries to figure out how to get Congress to support funding for the Earned Income Tax Credit.  Toby solicits  Annabeth\'s advice regarding proper behavior for Abbey at a NASCAR event.  Will asks why they originally chose Russell to be Vice President.  And Bartlet seems to have recovered most of his strength after his recent bout with MS.', 'Y', 'N', 7.7),
	('The West Wing', 'King Corn', 6, 13, 'Yes', 'Yes', 'No', 26, 1, 2005, 'The presidential candidates journey to Iowa, where democrats Russell and Santos, and republican Vinick, are all told by their handlers that when they appear before before the corn growers association they must support subsidies for the use of corn-derived ethanol as fuel, regardless of their true feelings.', 'Y', 'N', 8),
	('The West Wing', 'The Wake Up Call', 6, 14, 'Yes', 'Yes', 'No', 9, 2, 2005, 'Valentine\'s Day starts badly when the Iranian air force shoots down a British airliner, killing 100 passengers.  The U.K. Prime Minister threatens to retaliate by bombing nuclear reactor sites, which could doom future support for political reformers in Iran.  But C.J. has made an agreement with Abbey to allow the President to get more rest, and she is reluctant to awaken him at 5 A.M. to deal with the crisis.  Meanwhile, Toby and a visiting law professor answer questions from a foreign delegation that is trying to write a new constitution for the former Soviet Republic of Belarus, and harried staffers pass the buck of Leo\'s traditional meeting with the new Miss World.', 'Y', 'N', 7.8),
	('The West Wing', 'Freedonia', 6, 15, 'Yes', 'Yes', 'No', 16, 2, 2005, 'It\'s five days before the New Hampshire primary, and Josh is desperately trying to find a \'silver bullet\' that will get his candidate into the local debate between the two front-runners, Vice President Russell and former Vice President Hoynes.  Then, Josh and Santos\'s disagreements over how to run the campaign come to a head when Santos hires Josh\'s ex-girlfriend Amy Gardner to help him prepare for the debate he may never be in.  And Donna has a memorable encounter with a chicken.', 'Y', 'N', 8.3),
	('The West Wing', 'Drought Conditions', 6, 16, 'Yes', 'Yes', 'No', 23, 2, 2005, 'A new candidate for president, Senator Rafferty, has garnered much media attention with a ground-breaking speech about health care.  But her words contain interesting echoes of President Bartlet\'s original health plan, which is known only to White House insiders, and reporter Greg Brock suspects that Rafferty is being secretly supported by the incumbent.  Meanwhile, Toby is more than usually morose after the death of his brother.  A bill to combat drought conditions in the western U.S. gives C.J. problems, particularly in dealing with lobbyist Clifford Calley.  And Charlie tells Kate Harper that a man from his gym asked if she was dating anyone.', 'Y', 'N', 8),
	('The West Wing', 'A Good Day', 6, 17, 'Yes', 'Yes', 'No', 2, 3, 2005, 'Santos engineers a plot to get a stalled stem-cell bill scheduled for a vote in the House.  President Bartlet has an uncomfortable reunion with a rival economist with whom he split the Nobel Prize. A group of underage kids tries to convince Toby they deserve the right to vote.  Kate tries to resolve a silly border dispute with Canada before there is bloodshed.', 'Y', 'N', 8.5),
	('The West Wing', 'La Palabra', 6, 18, 'Yes', 'Yes', 'No', 9, 3, 2005, 'Santos is campaigning in California during the last few days before the all-important \'Super Tuesday\' primary elections, but he is out of money and he trails both Russell and Hoynes in the polls.  When even \'La Palabra\', a Latino voters group, is all set to endorse Hoynes instead of Santos, Josh urges Santos to take a stand on the new bill that denies driver\'s licenses to illegal immigrants.  Meanwhile, Donna tries to figure out why Hoynes suddenly isn\'t campaigning in California, and advances her position in the Russell campaign by becoming the Vice President\'s official spokesperson.', 'Y', 'N', 8.3),
	('The West Wing', 'Ninety Miles Away', 6, 19, 'Yes', 'Yes', 'No', 16, 3, 2005, 'New rumors about Fidel Castro\'s health cause the President to re-examine  the economic sanctions against Cuba that haven\'t worked for 40 years, and he sends Leo McGarry to meet secretly with the Cuban dictator.  The occasion causes C.J. to check into Kate Harper\'s past with the C.I.A., but she is unaware of a past encounter between Kate and Leo.  Meanwhile, Charlie discovers the complexities of dealing with a termite invasion of the White House.', 'Y', 'N', 7.3),
	('The West Wing', 'In God We Trust', 6, 20, 'Yes', 'Yes', 'No', 23, 3, 2005, 'Senator Vinick, now the Republican Presidential nominee, receives advice from former Bartlet political consultant Bruno Gianelli on how to win all 50 states in the general election, and more specifically in the near term how to present his religious views to the public and pick a running mate.  Meanwhile, Bartlet wrestles with getting a minimum wage hike passed by attaching it to a bill necessary to raise the debt ceiling, and with how to unify his party in the face of a three-way race for the Democratic nomination.', 'Y', 'N', 8.2),
	('The West Wing', 'Things Fall Apart', 6, 21, 'Yes', 'Yes', 'No', 30, 3, 2005, 'Faced with a Democratic party in disarray in the face of the strongest Republican challenger they have ever had, Bartlet asks Leo to take charge of the potentially chaotic Democratic National Convention, while Santos considers a party-unifying vice-presidential offer from front-runner Russell.  Meanwhile, the International Space Station is leaking oxygen and a rescue of the three astronauts will be difficult, and Bartlet catches Charlie leaving Zoey\'s bedroom after a nighttime visit.', 'Y', 'N', 8.1),
	('The West Wing', '2162 Votes', 6, 22, 'Yes', 'Yes', 'No', 6, 4, 2005, 'At the Democratic National Convention, Russell, Santos and Baker jockey for the 2162 votes that will give one of them the nomination for President, and the opportunity to lose to the apparently unstoppable Vinick in November.  Meanwhile, the President must make a decision before it\'s too late on whether to deploy a secret rescue mission to the space station, and the FBI is asked to determine who leaked the existence of the military shuttle to the press.', 'Y', 'N', 8.9),
	('The West Wing', 'The Ticket', 7, 1, 'Yes', 'Yes', 'No', 25, 9, 2005, 'As everyone but Josh causes Santos to question his choice of Leo as his running mate, Bartlet\'s investigation into the dangerous press leak continues. Also C.J. gets interviewed by Babish and Donna approaches Josh for a job.', 'Y', 'N', 8),
	('The West Wing', 'The Mommy Problem', 7, 2, 'Yes', 'Yes', 'No', 2, 10, 2005, 'Santos and Vinick have to deal with press fallout when it looks like the Bartlet White House is not going to continue the investigation into the press leaks.', 'Y', 'N', 7.9),
	('The West Wing', 'Message Of The Week', 7, 3, 'Yes', 'Yes', 'No', 9, 10, 2005, 'It\'s three weeks into the presidential campaign and Vinick meets with Frost out on the trail. Santos pulls a stunt which leads to higher approval ratings and jolts the Vinick camp. Vinick and Santos try to kick each other politically while they focus on their messages of the week.', 'Y', 'N', 7.9),
	('The West Wing', 'Mr. Frost', 7, 4, 'Yes', 'Yes', 'No', 16, 10, 2005, 'Margaret is interrogated at a hearing held by the Senate Select Committee on Intelligence; Santos deflects religious questions onto Vinick; Someone gives C.J. intelligence information; a Palestinian leader is assassinated and Bartlet wants to attend the funeral despite security concerns. Also, we learn Margaret\'s last name. ', 'Y', 'N', 7.9),
	('The West Wing', 'Here Today', 7, 5, 'Yes', 'Yes', 'No', 23, 10, 2005, 'The White House is trying to cope with the revelation of the identity of the leaker and Babish\'s questioning of Toby convinces him that he must get his lawyer. Lou persuades Josh to get Santos to clean house with his campaign staff. Kate finally reaches Charles Frost and confronts him about what he told to C.J. and a few other things about his personality in general. The Bartlets hear Ellie\'s heapful of \'good\' and \'bad\' news. ', 'Y', 'N', 8.4),
	('The West Wing', 'The Al Smith Dinner', 7, 6, 'Yes', 'Yes', 'No', 30, 10, 2005, 'Donna is back and she\'s working for the Santos/McGarry campaign, but not for Josh. An attack ad on Santos by a pro-life group puts Vinick in a corner when Santos demands Vinick renounce it but Vinick knows that if he does it will offend the G.O.P. leadership.', 'Y', 'N', 8),
	('The West Wing', 'The Debate', 7, 7, 'Yes', 'Yes', 'No', 6, 11, 2005, 'Santos and Vinick battle it out in primetime live. Forrest Saywer the moderator poses questions and attempts to ensure that the candidates remain within bounds. Ellen DeGeneres guest hosts the show on behalf of American Express and their new credit card.', 'Y', 'N', 8.8),
	('The West Wing', 'Undecideds', 7, 8, 'Yes', 'Yes', 'No', 13, 11, 2005, 'Lou and Santos run into trouble on the road when they try to pick up a family\'s vote; their child was shot by a Latino police officer. Also, CJ must manage a crisis between China and Kazakhstan.', 'Y', 'N', 8.1),
	('The West Wing', 'The Wedding', 7, 9, 'Yes', 'Yes', 'No', 11, 12, 2005, 'Santos is working on campaign strategy, Ellie\'s getting married, Abbey is welcoming guests, Bartlet\'s making jokes, China and Kazahkstan are about to go to war, Carol makes an appearance, and Josh may get fired.', 'Y', 'N', 8),
	('The West Wing', 'Running Mates', 7, 10, 'Yes', 'Yes', 'No', 8, 1, 2006, 'All eyes are looking forward to the Leo McGarry/Ray Sullivan Vice Presidential debate. Meawhile, Santos is trying not to catch his children\'s cold and he visits his home in Texas and continues to campaign. Jorge Santos, the Congressman\'s brother, may cause some problems at a gathering.', 'Y', 'N', 8.3),
	('The West Wing', 'Internal Displacement', 7, 11, 'Yes', 'Yes', 'No', 15, 1, 2006, 'The Westins visit Washington and Doug is keeping a secret from Liz that many other senior staffers already know about. C.J. tries to make a deal with the French to try to handle a problem in the Sudan. Gail is in trouble. Josh asks Will for a little help with the campaign. C.J. and Danny go out to dinner and talk like good old friends and C.J. likens men to salmon while dealing with a waitress who is not all that found of her.', 'Y', 'N', 8.1),
	('The West Wing', 'Duck And Cover', 7, 12, 'Yes', 'Yes', 'No', 22, 1, 2006, 'Bartlet must deal with the possiblity of a nuclear explosion in California, Kate is keeping a careful watch on the election in Kazakhstan and China\'s response, Will is acting as the government\'s voice this week, and Josh is trying to keep his political version of Tourette\'s in check.', 'Y', 'N', 8.5),
	('The West Wing', 'The Cold', 7, 13, 'Yes', 'Yes', 'No', 12, 3, 2006, 'After the near-nuclear disaster at the power plant the polls show surprising, or maybe not so surprising, results for both candidates. The Vinick camp gears up for backlash while the Santos camp hopes for cause to celebrate. Meanwhile Bartlet is still trying to keep the situation in Central Asia under control. Relationships in the Santos campaign, the Vinick campaign, and the West Wing all undergo changes and Vinick and Bartlet attempt to deal with different versions of the cold.', 'Y', 'N', 8.3),
	('The West Wing', 'Two Weeks Out', 7, 14, 'Yes', 'Yes', 'No', 19, 3, 2006, 'There are only two weeks left before Election Day and both candidates must make difficult choices at a time when they are both extremely tired. Vinick meets a famous athlete who greets him with a welcome that sings possible campaign trouble. Santos doesn\'t have such trouble with the athlete. Both candidates are campaigning in California with the hopes of stealing the election from the other guy in the hopes of thereby winning the election. Santos\' briefcase falls into the hands of the Vinick campaign.', 'Y', 'N', 8),
	('The West Wing', 'Welcome To Wherever You Are', 7, 15, 'Yes', 'Yes', 'No', 26, 3, 2006, 'The Santos campaign meets up with Rock the Vote and lots of musicians are around for a star-studded episode. Helen gives a lecture to MANA (a National Latina Organization, formerly Mexican American National Association) but her heritage doesn\'t help her when trying to deliver part of the Santos campaign message. Toby is being pressured by the Attorney General, Blake, to reveal his source and it\'s affecting his relationship with his kids. He tries a little psychological warfare of his own to get Blake to back down. Toby is also giving Josh campaign advice which includes plans to increase courtship of the Latino vote. Elsewhere on the campaign trail, it\'s Halloween and Toby\'s kids and Santos\' kids are dressing up for the occasion.', 'Y', 'N', 7.9),
	('The West Wing', 'Election Day - 1', 7, 16, 'Yes', 'Yes', 'No', 2, 4, 2006, 'Election Day finally arrives, and between analyzing exit polls, and mulling over news reports, a few Santos staff members discover the joys of campaign romance. Meanwhile, C.J. ponders life after the White House; and Annabeth makes a tragic discovery.', 'Y', 'N', 8.6),
	('The West Wing', 'Election Day - 2', 7, 17, 'Yes', 'Yes', 'No', 9, 4, 2006, 'Abbey is in New Hamphire with Liz Bartlet-Westin and they are awaiting the results of Doug Westin\'s campaign for a seat in Congress. Members of both the Santos campaign and the Vinick campaign must decide how to handle a tragedy, as the voters around the country continue to cast their votes for the next President of the United States.', 'Y', 'N', 9),
	('The West Wing', 'Requiem', 7, 18, 'Yes', 'Yes', 'No', 16, 4, 2006, 'Former series regulars, including Marlee Matlin, Mary-Louise Parker, Tim Matheson, Anna Deavere Smith and Gary Cole, make guest appearances as Bartlet, Santos and their staff members attend a funeral for one of their own. Also, Josh cautions Santos about getting involved in the vote for Speaker of the House.', 'Y', 'N', 8.9),
	('The West Wing', 'Transition', 7, 19, 'Yes', 'Yes', 'No', 23, 4, 2006, 'Former cast member Rob Lowe returns as a senior political official in this episode, which finds Bartlet and his staff making the transition as easy as possible for the president-elect, who discovers some unpleasant realities about his new job. Meanwhile, a stressed-out Josh realizes that he may need to take some time off after he reaches his breaking point.', 'Y', 'N', 8.5),
	('The West Wing', 'The Last Hurrah', 7, 20, 'Yes', 'Yes', 'No', 30, 4, 2006, 'While Santos is busy trying to select a new vice president, his wife finds her new responsibilities staggering. Meanwhile, Vinick ponders his next move.', 'Y', 'N', 8.4),
	('The West Wing', 'Institutional Memory', 7, 21, 'Yes', 'Yes', 'No', 7, 5, 2006, 'C.J. and Will both face uncertain futures as Bartlet and his staffers prepare to leave the White House to make way for the Santos administration.', 'Y', 'N', 8.6),
	('The West Wing', 'Tomorrow', 7, 22, 'Yes', 'Yes', 'No', 14, 5, 2006, 'After seven seasons of the Award-winning drama series, the Bartlet Administration prepares to leave the White House and The West Wing. While Santos and his winning camp are nervously gearing up for the presidential inauguration, current President Bartlet (Martin Sheen), CJ (Allison Janney) and the others fondly look back as they prepare to leave the White House forever.', 'Y', 'N', 8.9),
	('The X-Files', 'Pilot', 1, 1, 'Yes', 'Yes', 'Yes', 10, 9, 1993, 'Special Agent Dana Scully is partnered with Special Agent Fox Mulder to validate his work on a special project called the X-Files. While he is a believer in the paranormal fueled by a lost memory of his sister\'s abduction, she is a scientist and prefers to look for rational, logical explanations. Their first case takes them to Oregon to investigate the unsolved murders of several High School classmates who \'Spooky\' Mulder believes have been experimented on by aliens.', 'Y', 'N', 8.3),
	('The X-Files', 'Deep Throat', 1, 2, 'Yes', 'Yes', 'Yes', 17, 9, 1993, 'Mulder and Scully head to Ellens Air Force Base to investigate the mysterious case of a military test pilot who disappeared after experiencing strange psychotic behavior. While on the case, Mulder meets a mysterious man dubbed \'Deep Throat\' who claims to have classified information about his investigations into the paranormal.', 'Y', 'N', 8.3),
	('The X-Files', 'Squeeze', 1, 3, 'Yes', 'Yes', 'Yes', 24, 9, 1993, 'One of Scully\'s friends from the FBI academy, now working in the Violent Crimes Unit, asks her to assist him on a homicide investigation involving no clear point of entry. Mulder realizes that this is similar to a series of X-Files cases that have occurred every thirty years and joins in the investigation to stop the latest cycle.', 'Y', 'N', 8.7),
	('The X-Files', 'Conduit', 1, 4, 'Yes', 'Yes', 'Yes', 1, 10, 1993, 'As Section Chief Blevins expresses his concern with the direction of the X-Files, Mulder becomes obsessed with solving a case that closely parallels an encounter he experienced as a child - the abduction of his kid sister, Samantha.', 'Y', 'N', 7.7),
	('The X-Files', 'The Jersey Devil', 1, 5, 'Yes', 'Yes', 'Yes', 8, 10, 1993, 'The murder of a homeless man that is very similar in detail to a murder committed in 1947 leads Mulder and Scully to a legendary man-beast roaming in the forest near Atlantic City.', 'Y', 'N', 7.2),
	('The X-Files', 'Shadows', 1, 6, 'Yes', 'Yes', 'Yes', 22, 10, 1993, 'When an unseen force commits several murders where a young woman is present, Mulder suspects that it is the spirit of the woman\'s former boss protecting her, while Scully believes the boss merely faked his own death.', 'Y', 'N', 7.4),
	('The X-Files', 'Ghost In The Machine', 1, 7, 'Yes', 'Yes', 'Yes', 29, 10, 1993, 'A computer with highly advanced Artificial Intelligence begins to kill in order to preserve its existence when it is deemed inefficient to continue controlling the workings of an office building.', 'Y', 'N', 6.8),
	('The X-Files', 'Ice', 1, 8, 'Yes', 'Yes', 'Yes', 5, 11, 1993, 'When members of an Arctic research team mysteriously kill each other and themselves only days after drilling deeper into the ice than ever before, Mulder and Scully accompany a team of doctors and scientists to investigate. They discover an organism that infects living creatures and accelerates the hosts\' feelings of anger and paranoia, and the agents\' colleagues on the expedition begin to question their government knowledge.', 'Y', 'N', 8.9),
	('The X-Files', 'Space', 1, 9, 'Yes', 'Yes', 'Yes', 12, 11, 1993, 'A mysterious force is sabotaging a space launch program, which leads directly back to the commander of the team who once led a mission to Mars and claimed to have seen an alien in space.', 'Y', 'N', 6.2),
	('The X-Files', 'Fallen Angel', 1, 10, 'Yes', 'Yes', 'Yes', 19, 11, 1993, 'Mulder puts the future of the X-Files in jeopardy when he heads to a UFO crash site being rapidly covered up by the military. He is arrested, and while in jail he meets Max Fenig, a UFO nut whose NICAP group has followed Mulder\'s work on the X-Files. When Mulder is released, Scully urges him to return to Washington to face his superiors and try to save his job, but Mulder finds out that Max is more than meets the eye and ignores Scully to try and save him instead.', 'Y', 'N', 8.1),
	('The X-Files', 'Eve', 1, 11, 'Yes', 'Yes', 'Yes', 10, 12, 1993, 'When two fathers on opposite sides of the country are inexplicably murdered at the exact same time in the exact same way, Mulder and Scully are called in to investigate. When they discover that the two fathers\' eight-year-old daughters are identical twins, they realize that something even stranger is going on.', 'Y', 'N', 8.3),
	('The X-Files', 'Fire', 1, 12, 'Yes', 'Yes', 'Yes', 17, 12, 1993, 'An old Oxford girlfriend of Mulder\'s asks for his help on an international case concerning the unexplainable execution of several British dignitaries, and they encounter an assassin who can produce fire from his bare hands.', 'Y', 'N', 7.5),
	('The X-Files', 'Beyond The Sea', 1, 13, 'Yes', 'Yes', 'Yes', 7, 1, 1994, 'When death row inmate Luther Lee Boggs claims to be psychic and can lead Mulder to a serial killer in return for a lesser sentence of life in prison, Scully becomes an unwilling believer when Boggs tells her that she can communicate through him with her recently deceased father.', 'Y', 'N', 8.8),
	('The X-Files', 'Gender Bender', 1, 14, 'Yes', 'Yes', 'Yes', 21, 1, 1994, 'A series of sexually-oriented murders, which are identical except that the killer appears to be both male and female, draws Scully and Mulder to an Amish-type community of people called the Kindred.', 'Y', 'N', 7.6),
	('The X-Files', 'Lazarus', 1, 15, 'Yes', 'Yes', 'Yes', 4, 2, 1994, 'When FBI Agent Jack Willis and bank robber Warren Dupre are both shot at the same time during a robbery attempt, Dupre dies when Willis is brought back to life. When Willis rushes out of the hospital and begins acting strangely, Mulder concludes that Dupre has come back to life in Willis\' body.', 'Y', 'N', 7.2),
	('The X-Files', 'Young At Heart', 1, 16, 'Yes', 'Yes', 'Yes', 11, 2, 1994, 'Mulder becomes the target of someone from his past named John Barnett. He was a jewelry store robber with an itchy trigger finger that Mulder sent to prison when he first joined the Bureau. The only problem is that Barnett died four years ago.', 'Y', 'N', 7.5),
	('The X-Files', 'E.B.E.', 1, 17, 'Yes', 'Yes', 'Yes', 18, 2, 1994, 'Mulder and Scully receive information from Deep Throat about a UFO that was shot down over Iraq and has been secretly transported to the US. However, Deep Throat then intentionally misleads the agents to prevent them from discovering the truth.', 'Y', 'N', 8.7),
	('The X-Files', 'Miracle Man', 1, 18, 'Yes', 'Yes', 'Yes', 18, 3, 1994, 'A young man who has the power to heal people with his touch begins to question his gift when people start dying after he has supposedly healed them.', 'Y', 'N', 7.2),
	('The X-Files', 'Shapes', 1, 19, 'Yes', 'Yes', 'Yes', 1, 4, 1994, 'Mulder and Scully travel to a Native American reservation to investigate the death of a man who was mistaken for a wild animal and may have been the legendary Manitou, a man who can shape-shift into a beast.', 'Y', 'N', 7.1),
	('The X-Files', 'Darkness Falls', 1, 20, 'Yes', 'Yes', 'Yes', 15, 4, 1994, 'When a group of loggers in the Washington State National Forest disappear in the same way that another group disappeared 50 years ago, Mulder and Scully go along to investigate and find themselves trapped in a cabin surrounded by flesh eating insects that only attack at night.', 'Y', 'N', 8.6),
	('The X-Files', 'Tooms', 1, 21, 'Yes', 'Yes', 'Yes', 22, 4, 1994, 'Eugene Tooms is released from the sanitarium, and Mulder becomes personally involved to ensure that he is caught in the act of getting the last human liver he needs to go into hibernation for another 30 years.', 'Y', 'N', 8.5),
	('The X-Files', 'Born Again', 1, 22, 'Yes', 'Yes', 'Yes', 29, 4, 1994, 'After a detective and his former partner die in unexplained circumstances, the accidents are linked to a little girl who witnessed both deaths. Mulder believes that she may be the reincarnation of a policeman murdered by his colleagues.', 'Y', 'N', 7.3),
	('The X-Files', 'Roland', 1, 23, 'Yes', 'Yes', 'Yes', 6, 5, 1994, 'Mulder and Scully investigate the death of a scientist working on advanced propulsion technology. The mentally challenged janitor Roland, who has secretly been completely the scientist\'s work, is the prime suspect.', 'Y', 'N', 7.4),
	('The X-Files', 'The Erlenmeyer Flask', 1, 24, 'Yes', 'Yes', 'Yes', 13, 5, 1994, 'When Deep Throat points out a news story about a fugitive who apparently drowned, Mulder and Scully cannot see what makes the case special but follow it up anyway. With Deep Throat\'s insistence, they discover evidence of a secret government project code-named Purity Control, which uses human test subjects and infects them with extraterrestrial DNA. However, the evidence and everyone who has seen it is quickly being eliminated.', 'Y', 'N', 9.1),
	('The X-Files', 'Little Green Men', 2, 1, 'Yes', 'Yes', 'Yes', 16, 9, 1994, 'With the X-Files closed, Scully has been assigned as an instructor at the FBI Academy while Mulder is doing menial surveillance work. After meeting with Senator Matheson, one of his supporters in regards to the X-Files, Mulder disobeys orders and heads to an abandoned SETI site in Puerto Rico which has inexplicably reactivated itself and could provide proof of contact with extra-terrestrial life.', 'Y', 'N', 8.3),
	('The X-Files', 'The Host', 2, 2, 'Yes', 'Yes', 'Yes', 23, 9, 1994, 'A.D. Skinner sends Mulder to investigate a body which washed into the New Jersey sewer from the ocean. Mulder believes that the basic blue-collar assignment is punishment, but by Skinner\'s own admission, what he discovers is a true X-File.', 'Y', 'N', 8.4),
	('The X-Files', 'Blood', 2, 3, 'Yes', 'Yes', 'Yes', 30, 9, 1994, 'When several violent deaths in a small farming community are connected by the destruction of digital devices, Mulder believes that people are being driven to kill by the use of subliminal messages in the digital readouts.', 'Y', 'N', 7.7),
	('The X-Files', 'Sleepless', 2, 4, 'Yes', 'Yes', 'Yes', 7, 10, 1994, 'Mulder reluctantly accepts a new partner, Agent Alex Krycek, and they investigate the deaths of several Green Beret soldiers who participated in a sleep deprivation experiment during the Vietnam war.', 'Y', 'N', 7.9),
	('The X-Files', 'Duane Barry', 2, 5, 'Yes', 'Yes', 'Yes', 14, 10, 1994, 'Mulder is called to a hostage situation involving Duane Barry, a former FBI Agent who claims to be an alien abductee and wants to get back to the abduction site with someone who will be taken instead of him. Unfortunately, the someone he eventually chooses is Scully.', 'Y', 'N', 8.8),
	('The X-Files', 'Ascension', 2, 6, 'Yes', 'Yes', 'Yes', 21, 10, 1994, 'When Mulder finds out that Scully was kidnapped by Duane Barry, he risks the wrath of his superiors and the annoyance of Agent Krycek in order to do whatever it takes to find her. Meanwhile, Krycek is found to be reporting Mulder\'s activities to the Cigarette-Smoking Man.', 'Y', 'N', 8.8),
	('The X-Files', '3', 2, 7, 'Yes', 'Yes', 'Yes', 4, 11, 1994, 'Mulder, back on the X-Files but alone for the first time, investigates a series of vampire-like murders in Los Angeles and finds himself falling for the one woman that may be the prime suspect.', 'Y', 'N', 6.6),
	('The X-Files', 'One Breath', 2, 8, 'Yes', 'Yes', 'Yes', 11, 11, 1994, 'Scully mysteriously appears in a Washington hospital, alive but in a coma, and Mulder must fight to keep her alive in order to find out what happened to her and who did it to her. Meanwhile, Scully fights her own personal battle as she decides whether to stay or go on to the next world.', 'Y', 'N', 8.6),
	('The X-Files', 'Firewalker', 2, 9, 'Yes', 'Yes', 'Yes', 18, 11, 1994, 'Mulder and Scully, reunited at last, head for an active volcano under a geological study and find a deadly life form that can survive in the searing heat of the crater and is killing the scientists to avoid being discovered.', 'Y', 'N', 7.4),
	('The X-Files', 'Red Museum', 2, 10, 'Yes', 'Yes', 'Yes', 9, 12, 1994, 'While investigating the connection between the abduction of several teenagers and a rural religious cult, Mulder and Scully discover a secret test being performed on the children using the \'Purity Control\' alien DNA from \'The Erlenmeyer Flask\' which leads Mulder to \'the crew-cut man\', Deep Throat\'s murderer.', 'Y', 'N', 7.9),
	('The X-Files', 'Excelsis Dei', 2, 11, 'Yes', 'Yes', 'Yes', 16, 12, 1994, 'Mulder and Scully uncover strange occurrences in an elderly care home when one of the nurses is attacked by an unseen force she claims to be one of the 90 year old residents.', 'Y', 'N', 7.2),
	('The X-Files', 'Aubrey', 2, 12, 'Yes', 'Yes', 'Yes', 6, 1, 1995, 'When a detective mysteriously uncovers the remains of an FBI agent who disappeared in the 1940s while investigating a similar murder case to one she is now on, Mulder and Scully believe that the original killer had passed his genetic trait of violence to his grandchild.', 'Y', 'N', 7.7),
	('The X-Files', 'Irresistible', 2, 13, 'Yes', 'Yes', 'Yes', 13, 1, 1995, 'A mortuary worker who gets his thrills from collecting hair and fingernails from the dead begins killing his soon-to-be collectibles himself and sets his seriously disturbed sights on Scully.', 'Y', 'N', 8.3),
	('The X-Files', 'Die Hand Die Verletzt', 2, 14, 'Yes', 'Yes', 'Yes', 27, 1, 1995, 'The ritualistic murder of a teenager in a small town gets Mulder and Scully caught up in a secret occult practice within the local school\'s PTA and a substitute teacher with strange powers.', 'Y', 'N', 8.3),
	('The X-Files', 'Fresh Bones', 2, 15, 'Yes', 'Yes', 'Yes', 3, 2, 1995, 'While investigating several deaths and murders within a Haitian refugee camp, Mulder and Scully get caught in the middle of a secret war between the camp commander and a Voodoo priest.', 'Y', 'N', 7.2),
	('The X-Files', 'Colony', 2, 16, 'Yes', 'Yes', 'Yes', 10, 2, 1995, 'After the obituaries of four identical men are e-mailed to Mulder, the agents are contacted by a shadowy CIA agent who tells them about a bounty hunter sent to wipe out the beginning of a colony of clones. Meanwhile Mulder is distracted by the sudden reappearance of his sister Samantha.', 'Y', 'N', 9),
	('The X-Files', 'End Game', 2, 17, 'Yes', 'Yes', 'Yes', 17, 2, 1995, 'The alien bounty hunter kidnaps Scully and wants to trade her for Mulder\'s sister, who is revealed to be a clone herself. After the trade goes badly and Mulder discovers the truth about Samantha, he tracks the bounty hunter to his ship buried in the arctic ice and demands the whereabouts of his real sister.', 'Y', 'N', 9),
	('The X-Files', 'Fearful Symmetry', 2, 18, 'Yes', 'Yes', 'Yes', 24, 2, 1995, 'Mulder and Scully investigate strange attacks from invisible animals inside a zoo which is near a known UFO hot spot.', 'Y', 'N', 6.5),
	('The X-Files', 'Dod Kalm', 2, 19, 'Yes', 'Yes', 'Yes', 10, 3, 1995, 'When half the crew of a Navy ship abandon their boat in a life raft and are rescued 18 hours later looking about 60 years older than they should be, Mulder suggests that the ship is caught in a time field which is speeding up their aging.', 'Y', 'N', 7.7),
	('The X-Files', 'Humbug', 2, 20, 'Yes', 'Yes', 'Yes', 31, 3, 1995, 'Mulder and Scully travel to Gibsonton, Florida, a town built and populated by circus and sideshow performers to investigate the death of Jerald Glazebrook, The Alligator Man. While searching for leads on the killer, the agents come across many bizarre characters including the local sheriff who was once known as Jim Jim, the Dog-Faced Boy.', 'Y', 'N', 8.8),
	('The X-Files', 'The Calusari', 2, 21, 'Yes', 'Yes', 'Yes', 14, 4, 1995, 'The suspicious circumstances of a toddler\'s death leads Mulder and Scully into a Romanian exorcism ritual involving a young boy possessed by his stillborn twin.', 'Y', 'N', 7.6),
	('The X-Files', 'F. Emasculata', 2, 22, 'Yes', 'Yes', 'Yes', 28, 4, 1995, 'When a plague-like illness kills ten men inside a maximum security prison, Scully tries to get into the quarantine site and discover the cause and origin of the contagion, while Mulder and a group of US Marshals track two escapees who may be infected.', 'Y', 'N', 8.2),
	('The X-Files', 'Soft Light', 2, 23, 'Yes', 'Yes', 'Yes', 5, 5, 1995, 'An experiment in dark matter accidentally turns a scientist\'s shadow into a deadly weapon that can unzip a person\'s molecules if they are touched by it.', 'Y', 'N', 8),
	('The X-Files', 'Our Town', 2, 24, 'Yes', 'Yes', 'Yes', 12, 5, 1995, 'After several disappearances in a small town, Mulder and Scully investigate and find hundreds of human bones in the river. They discover that the man behind the town\'s main source of wealth, a chicken processing plant, has found a way to prolong his life through cannibalism.', 'Y', 'N', 8.1),
	('The X-Files', 'Anasazi', 2, 25, 'Yes', 'Yes', 'Yes', 19, 5, 1995, 'When Mulder obtains what could be the original and uncut MJ documents containing information about the government\'s knowledge of extraterrestrial life; his shadowy enemies step up their harassment of him, eventually leading to his apparent murder.', 'Y', 'N', 9.3),
	('The X-Files', 'The Blessing Way', 3, 1, 'Yes', 'Yes', 'Yes', 22, 9, 1995, 'Scully finds her career with the FBI in jeopardy as Mulder is still missing and the Cigarette-Smoking Man is pursuing the stolen files. The Navajo elders find Mulder\'s body in a cave and perform an ancient ceremony to call the spirit back to the empty vessel.', 'Y', 'N', 8.8),
	('The X-Files', 'Paper Clip', 3, 2, 'Yes', 'Yes', 'Yes', 29, 9, 1995, 'A.D. Skinner and Scully are at a standoff when Mulder bursts in and discovers that Skinner has the digital tape. Reunited, Mulder and Scully travel to a secret vault inside a mine and find an elaborate filing system of medical records which reveals that Mulder\'s sister may not have been the first choice for abduction. Meanwhile, Skinner deals with the Cigarette-Smoking Man for their safety.', 'Y', 'N', 9.2),
	('The X-Files', 'D.P.O.', 3, 3, 'Yes', 'Yes', 'Yes', 6, 10, 1995, 'Mulder and Scully investigate a series of human and cattle deaths by lightning and are led to a teenage boy who is the only survivor out of five people recently hit by lightning strikes.', 'Y', 'N', 8),
	('The X-Files', 'Clyde Bruckman\'s Final Repose', 3, 4, 'Yes', 'Yes', 'Yes', 13, 10, 1995, 'In the midst of a psychic sideshow while on a murder case, Mulder and Scully enlist the help of a man who may have a true psychic ability to foresee how people will die to help the agents catch a man killing fortune tellers.', 'Y', 'N', 9.3),
	('The X-Files', 'The List', 3, 5, 'Yes', 'Yes', 'Yes', 20, 10, 1995, 'Nobody takes much notice when a death row inmate vows on the electric chair to come back from the dead and kill five men who have wronged him during his time in prison, until a guard is mysteriously murdered in the former inmate\'s cell.', 'Y', 'N', 7.3),
	('The X-Files', '2Shy', 3, 6, 'Yes', 'Yes', 'Yes', 3, 11, 1995, 'A man with a genetic abnormality who must prey on overweight women in order to suck the fatty tissue from their bodies, begins to meet his victims through internet chat rooms.', 'Y', 'N', 7.7),
	('The X-Files', 'The Walk', 3, 7, 'Yes', 'Yes', 'Yes', 10, 11, 1995, 'After a suicide attempt and multiple murders at a military hospital, Mulder and Scully meet a quadruple amputee who has gained the power of astral projection and is taking out his personal frustrations on his commanding officers.', 'Y', 'N', 7.4),
	('The X-Files', 'Oubliette', 3, 8, 'Yes', 'Yes', 'Yes', 17, 11, 1995, 'Mulder seeks the help of a woman who he believes has a special connection with a young girl who has recently been kidnapped by the same man who held her captive many years earlier.', 'Y', 'N', 7.9),
	('The X-Files', 'Nisei', 3, 9, 'Yes', 'Yes', 'Yes', 24, 11, 1995, 'An investigation into a video of an alien autopsy puts Mulder and Scully in the middle of a conspiracy involving WWII Japanese scientists brought to America to continue their experiments which may shed light on Scully\'s abduction.', 'Y', 'N', 8.7),
	('The X-Files', '731', 3, 10, 'Yes', 'Yes', 'Yes', 1, 12, 1995, 'Mulder is trapped inside a train car which contains a suspected alien-human hybrid and also a bomb, while Scully pursues the truth about her abduction and the mystery behind the implant in her neck.', 'Y', 'N', 8.9),
	('The X-Files', 'Revelations', 3, 11, 'Yes', 'Yes', 'Yes', 15, 12, 1995, 'Mulder and Scully swap roles as they pursue a man killing priests that claim to have the wounds of Christ. The agents find and must protect a young boy who may be a real stigmatic. While Scully\'s faith draws her close to the boy, Mulder is convinced of another explanation.', 'Y', 'N', 7.4),
	('The X-Files', 'War Of The Coprophages', 3, 12, 'Yes', 'Yes', 'Yes', 5, 1, 1996, 'Widespread panic is caused in a small community after numerous deaths are linked to killer cockroaches, and a government agricultural agency is discovered to have set up a secret experiment involving insects.', 'Y', 'N', 8.9),
	('The X-Files', 'Syzygy', 3, 13, 'Yes', 'Yes', 'Yes', 26, 1, 1996, 'A rare planetary alignment causes strange behavior in the residents of a small town, but particularly in two teenage girls who were born at the exact same moment on that date.', 'Y', 'N', 7.9),
	('The X-Files', 'Grotesque', 3, 14, 'Yes', 'Yes', 'Yes', 2, 2, 1996, 'A serial killer is captured after a three year manhunt, and he claims an evil spirit is responsible for the crimes. When the killings continue as he sits in jail, Mulder\'s battle with a former colleague gets more heated when he suggests that something more paranormal may be involved.', 'Y', 'N', 7.7),
	('The X-Files', 'Piper Maru', 3, 15, 'Yes', 'Yes', 'Yes', 9, 2, 1996, 'A French salvage ship searching for a lost WWII fighter plane unknowingly surfaces an alien which appears in the form of black oil and has the ability to jump hosts. Mulder heads to Hong Kong to investigate the salvage broker who sold the information to the French and he encounters Krycek, who has been selling information from the MJ documents. As Mulder prepares to take Krycek back to the US, the alien makes its way to Hong Kong and takes control of Krycek.', 'Y', 'N', 8.7),
	('The X-Files', 'Apocrypha', 3, 16, 'Yes', 'Yes', 'Yes', 16, 2, 1996, 'Mulder pursues Krycek (unaware of  the alien that has taken over his body) to get back the DAT tape containing the MJ documents. Meanwhile, the shooting of A.D. Skinner uncovers evidence that could lead Scully to her sister\'s murderer.', 'Y', 'N', 8.8),
	('The X-Files', 'Pusher', 3, 17, 'Yes', 'Yes', 'Yes', 23, 2, 1996, 'Mulder and Scully are asked to help in a case involving Robert Patrick Modell, a murderer possessing the psychic ability to force his will onto people. Due to a brain tumor that is slowly killing him, he is searching for a \'worthy adversary\' and forces Mulder into a battle of mind over matter.', 'Y', 'N', 8.7),
	('The X-Files', 'Teso Dos Bichos', 3, 18, 'Yes', 'Yes', 'Yes', 8, 3, 1996, 'The unearthing of an ancient Ecuadorian Amaru urn and its removal to America despite protests leads to a series of deaths linked to a shaman spirit released by the urn.', 'Y', 'N', 5.9),
	('The X-Files', 'Hell Money', 3, 19, 'Yes', 'Yes', 'Yes', 29, 3, 1996, 'The deaths of several Chinese men found to be missing vital internal organs that were removed prior to death leads Mulder and Scully to a deadly Chinatown lottery where men wager their body parts for a chance to win a cash jackpot.', 'Y', 'N', 7.2),
	('The X-Files', 'Jose Chung\'s From Outer Space', 3, 20, 'Yes', 'Yes', 'Yes', 12, 4, 1996, 'A alien abduction of two teenagers with endless versions of the same story prompts a science-fiction novelist to to write a book about the incident; however, nobody involved with the investigation can tell him the full story with any accuracy.', 'Y', 'N', 9.1),
	('The X-Files', 'Avatar', 3, 21, 'Yes', 'Yes', 'Yes', 26, 4, 1996, 'During a one-night-stand in the midst of his divorce, A.D. Skinner becomes a murder suspect, and Mulder and Scully return the many favors that he has done for them by analyzing evidence that someone doesn\'t want uncovered to prove his innocence.', 'Y', 'N', 7.9),
	('The X-Files', 'Quagmire', 3, 22, 'Yes', 'Yes', 'Yes', 3, 5, 1996, 'Mulder and Scully investigate a series of disappearances and attacks around a lake where Mulder believes that the local legend about a lake monster may be all too real.', 'Y', 'N', 8.3),
	('The X-Files', 'Wetwired', 3, 23, 'Yes', 'Yes', 'Yes', 10, 5, 1996, 'After a man kills three people and his wife because he mistook them for a ruthless middle eastern dictator, Mulder and Scully discover a test involving mind control using television signals that make people\'s worst fears become real in any form.', 'Y', 'N', 8.5),
	('The X-Files', 'Talitha Cumi', 3, 24, 'Yes', 'Yes', 'Yes', 17, 5, 1996, 'Mulder and Scully search for a mysterious man with the power to heal. His actions risk exposing the existence of aliens on Earth, while a confrontation between Mrs. Mulder and the Cigarette-Smoking Man leads Mulder to the discovery of the only weapon which can kill the aliens.', 'Y', 'N', 8.8),
	('The X-Files', 'Herrenvolk', 4, 1, 'Yes', 'Yes', 'No', 4, 10, 1996, 'Jeremiah Smith and Mulder are on the run from the alien bounty hunter, and Smith takes Mulder to a small farm tended to by identical sets of children, and all the girls are clones of his sister when she was still a child. Mulder prepares to take Jeremiah and one of the clones to see his mother in the hospital, but the bounty hunter catches up with them. Meanwhile, the Syndicate suspects that they have a traitor in their midst and plan a trap which results in X being executed by the Cigarette-Smoking Man.', 'Y', 'N', 8.6),
	('The X-Files', 'Home', 4, 2, 'Yes', 'Yes', 'No', 11, 10, 1996, 'A baby is found buried alive in shallow ground and appears to have birth defects resulting from generations of inbreeding, leading Mulder and Scully to a reclusive family who have a history of inbred children.', 'Y', 'N', 9),
	('The X-Files', 'Teliko', 4, 3, 'Yes', 'Yes', 'No', 18, 10, 1996, 'After several African-American men are killed and the color is drained from their skin, Mulder learns about the Teliko, an African folktale about a creature who must suck the pigmentation from a persons body in order to survive.', 'Y', 'N', 6.8),
	('The X-Files', 'Unruhe', 4, 4, 'Yes', 'Yes', 'No', 27, 10, 1996, 'Several kidnappings of young women linked by distorted photographs lead Mulder and Scully to a man who can imprint his darkest fantasies onto undeveloped film and is trying to save the women from the \'Howlers\'.', 'Y', 'N', 8.3),
	('The X-Files', 'The Field Where I Died', 4, 5, 'Yes', 'Yes', 'No', 3, 11, 1996, 'After an FBI raid on a doomsday cult called the \'Temple of the Seven Stars\', Mulder meets Melissa, a cultist who claims to have known him in a previous life during the American Civil War. Scully believes the woman is a delusional schizophrenic, but Mulder allows himself to be drawn into her fantasies.', 'Y', 'N', 7),
	('The X-Files', 'Sanguinarium', 4, 6, 'Yes', 'Yes', 'No', 10, 11, 1996, 'A link to the four witches Sabbaths is found after a doctor loses control and kills a patient on the operating table, and Mulder suspects a nurse may be practicing witchcraft.', 'Y', 'N', 7.5),
	('The X-Files', 'Musings Of A Cigarette Smoking Man', 4, 7, 'Yes', 'Yes', 'No', 17, 11, 1996, 'Frohike pieces together and recites to Mulder and Scully what could be the possible life story of the Cigarette Smoking Man; from a young captain in the U.S. Army recruited to assassinate President Kennedy, to becoming the mysterious man in the shadows at the height of a global conspiracy. What measures will the Cigarette Smoking Man take to ensure that he remains a mystery forever?', 'Y', 'N', 9.2),
	('The X-Files', 'Tunguska', 4, 8, 'Yes', 'Yes', 'No', 24, 11, 1996, 'A rock sample taken from Mars is intercepted at an airport and infects a security officer with the Black Cancer, while Mulder is given a tip about potentially dangerous paramilitary operations but is doubtful when the informant turns out to be Alex Krycek.   Reluctantly, Mulder accepts Krycek\'s help and tracks the rock to Russia where he discovers an elaborate test being performed by Russian scientists.', 'Y', 'N', 8.8),
	('The X-Files', 'Terma', 4, 9, 'Yes', 'Yes', 'No', 1, 12, 1996, 'While imprisoned in Russia and infected with the Black Cancer, Mulder learns that Krycek is working with the men responsible and everything has been a setup from the start, while Scully and Skinner are called to a suspicious Senate hearing where the only question is the whereabouts of Agent Mulder.', 'Y', 'N', 8.5),
	('The X-Files', 'Paper Hearts', 4, 10, 'Yes', 'Yes', 'No', 15, 12, 1996, 'Mulder\'s dreams help him in finding the body of a little girl which reopens one of his old cases in the Violent Crimes Unit and leads him to believe the killer he captured had more victims and may have taken his sister many years before.', 'Y', 'N', 9),
	('The X-Files', 'El Mundo Gira', 4, 11, 'Yes', 'Yes', 'No', 12, 1, 1997, 'A strange yellow rain kills a migrant girl, and her family believes that a mythical creature was the cause and has manifested itself inside the brother of her fiance, who has since disappeared.', 'Y', 'N', 6.9),
	('The X-Files', 'Leonard Betts', 4, 12, 'Yes', 'Yes', 'No', 26, 1, 1997, 'After the body of a decapitated EMT disappears from the morgue and an identical man starts work at the same hospital, Mulder believes that the man has the ability to regrow parts of his body, including his head. The agents soon discover that Betts\' body is riddled with cancer and he is able to live in that condition but needs to feed on cancerous tumors to keep up his strength.', 'Y', 'N', 8.5),
	('The X-Files', 'Never Again', 4, 13, 'Yes', 'Yes', 'No', 2, 2, 1997, 'While Mulder is forced to take a vacation he leaves Scully with an assignment to keep her busy until he returns. However, she decides to start living and goes on a date with a man who believes that his tattoo talks to him and is telling him to stay away from other women.', 'Y', 'N', 7.8),
	('The X-Files', 'Memento Mori', 4, 14, 'Yes', 'Yes', 'No', 9, 2, 1997, 'Scully\'s recent failing health is revealed to be inoperable brain cancer, which is common among abductees. She meets with other abductees with the same condition and forms a special bond with a dying woman, while Mulder tries to save her from a doctor who may be connected with the abductions.', 'Y', 'N', 8.6),
	('The X-Files', 'Kaddish', 4, 15, 'Yes', 'Yes', 'No', 16, 2, 1997, 'Issac Luria, a Jewish man, is killed by a group of teenagers working for a racist shop owner, but one of them is soon strangled to death, and the fingerprints on his neck are from Issac. Despite other factors, Mulder becomes convinced that the man has returned from the dead to exact revenge.', 'Y', 'N', 7.2),
	('The X-Files', 'Unrequited', 4, 16, 'Yes', 'Yes', 'No', 23, 2, 1997, 'When a U.S. military general is inexplicably murdered in the back of his limousine, a paramilitary group is suspected. They believe it was a soldier who they liberated from a Vietnam POW camp and is plotting to kill certain corrupt military figures.', 'Y', 'N', 7.5),
	('The X-Files', 'Tempus Fugit', 4, 17, 'Yes', 'Yes', 'No', 16, 3, 1997, 'While celebrating Scully\'s 33rd birthday, a strange woman informs Mulder that NICAP member Max Fenig (see Fallen Angel) has recently died in a plane crash. After a visit to the crash site and finding Max\'s body with radiation burns on it, Mulder suggests that the plane was intercepted by a UFO and is rapidly being covered up by the military.', 'Y', 'N', 8.6),
	('The X-Files', 'Max', 4, 18, 'Yes', 'Yes', 'No', 23, 3, 1997, 'Mulder is arrested for investigating the plane crash and interfering with a military operation, while Scully is caught in an attempted assassination of Corporal Frish which claims the life of Agent Pendrell. Scully bails Mulder out of prison, and they go to Max Fenig\'s trailer to find out why he was on the plane. Mulder finds evidence of alien technology and boards a plane with it, but the plane is intercepted mid-flight and it disappears. Mulder is again left with nothing.', 'Y', 'N', 8.6),
	('The X-Files', 'Synchrony', 4, 19, 'Yes', 'Yes', 'No', 6, 4, 1997, 'A case involving a strange old man warning two scientists of events in the immediate future which come to pass (and the use of their experimental flash-freezing compound that does not exist yet) has Mulder believing that one of the scientists has come from the future to stop his own scientific breakthrough from becoming reality.', 'Y', 'N', 7.8),
	('The X-Files', 'Small Potatoes', 4, 20, 'Yes', 'Yes', 'No', 20, 4, 1997, 'Five babies in the same town are all born with tails and the local OB-GYN is blamed for tampering with fertilized eggs. However, Mulder discovers the culprit to be a simple man with a genetic deformity who may have the ability to alter his appearance.', 'Y', 'N', 9.1),
	('The X-Files', 'Zero Sum', 4, 21, 'Yes', 'Yes', 'No', 27, 4, 1997, 'Skinner destroys evidence to cover up a woman\'s death and poses as Agent Mulder to complete the task. Mulder finds out about Skinner\'s deception and confronts him, and Skinner reveals that he is working for the Cigarette-Smoking Man in order to obtain a possible cure for Scully\'s cancer.', 'Y', 'N', 8.4),
	('The X-Files', 'Elegy', 4, 22, 'Yes', 'Yes', 'No', 4, 5, 1997, 'After a man sees a woman trapped inside a bowling alley pin setter, he goes for help and finds police standing next to a body of the same woman. Mulder and Scully join the investigation and follow up this lead which the police won\'t bother with, and they are led to a mentally challenged man who works at the bowling alley.', 'Y', 'N', 8),
	('The X-Files', 'Demons', 4, 23, 'Yes', 'Yes', 'No', 11, 5, 1997, 'Mulder undergoes an experimental form of hypnotherapy to recover his memories about his sister\'s abduction, but the treatment has side effects including psychotic behavior, and Mulder wakes up one morning in a motel room with someone else\'s blood all over him.', 'Y', 'N', 8.1),
	('The X-Files', 'Gethsemane', 4, 24, 'Yes', 'Yes', 'No', 18, 5, 1997, 'While investigating the discovery of a preserved alien body found in the mountains of Canada, Mulder is contacted by Michael Kritschgau. He tells Mulder about a government conspiracy to make people believe in aliens without question, and Mulder has been the prime target.', 'Y', 'N', 8.8),
	('The X-Files', 'Redux - 1', 5, 1, 'Yes', 'Yes', 'No', 2, 11, 1997, 'Scully helps Mulder fake his own death in order for him to go undetected through the Department of Defence and find out the answers to his new questions about the government hoax concerning the existence of extraterrestrial life. Meanwhile, at a joint FBI/DOD inquiry, Scully\'s attempt to drive out the Conspiracy\'s informant is halted as her cancer takes a bad turn.', 'Y', 'N', 8.9),
	('The X-Files', 'Redux - 2', 5, 2, 'Yes', 'Yes', 'No', 9, 11, 1997, 'The Cigarette-Smoking Man helps Mulder to obtain Scully\'s cure and also lets him see his real sister who doesn\'t turn out to be as happy to see Mulder as he would\'ve liked. In return for this, the Cigarette-Smoking Man asks that Mulder quit the FBI and work for him in the Syndicate where he could have power and respect which Mulder turns down, deciding to stay on the side of justice. While Scully\'s cure appears to have worked, the Cigarette-Smoking Man faces his own enemies and disappears, presumed dead.', 'Y', 'N', 9.2),
	('The X-Files', 'Unusual Suspects', 5, 3, 'Yes', 'Yes', 'No', 16, 11, 1997, 'Set in 1989, the story of the founding of The Lone Gunmen is finally told as we see how a straight-laced federal employee, a sex mad AV expert, and a nerdy computer hacker meet Susanne Modeski, a strange woman with evidence of a government conspiracy. When their plan to expose the conspiracy fails and Susanne is captured by a group of men-in-black, led by none other than X, they soon become a paranoid group of government watchdogs.', 'Y', 'N', 8.7),
	('The X-Files', 'Detour', 5, 4, 'Yes', 'Yes', 'No', 23, 11, 1997, 'While on their way to an FBI group communication seminar, Mulder and Scully manage to escape when they come across a situation in the Florida forest area where three men have recently disappeared.', 'Y', 'N', 8.4),
	('The X-Files', 'The Post-Modern Prometheus', 5, 5, 'Yes', 'Yes', 'No', 30, 11, 1997, 'Filmed in glorious black and white with a comic book feel to it, this is a modern retelling of Frankenstein as Mulder and Scully get caught up in a town where the residents live on Jerry Springer episodes and fear a two-faced monster who has been impregnating the women.', 'Y', 'N', 8.8),
	('The X-Files', 'Christmas Carol', 5, 6, 'Yes', 'Yes', 'No', 7, 12, 1997, 'On her Christmas vacation with her brother\'s family, Scully receives a mysterious phone call from a familiar voice who says, \'She needs your help. Go to her.\' The phone call leads Scully to a murder case where the victim\'s 3-year-old adopted daughter bears an uncanny likeness to her sister, Melissa, at that age. The emotional roller coaster that follows has Scully believing that her sister had a baby during a period when she traveled the country and she tries to adopt the child, knowing that caring for the little girl would change her life.', 'Y', 'N', 7.9),
	('The X-Files', 'Emily', 5, 7, 'Yes', 'Yes', 'No', 14, 12, 1997, 'DNA testing on Emily reveals that she is actually Scully\'s daughter and Mulder comes to assist her and to find out where and how the girl was born while Scully tries to help Emily with her own serious illness, a rare form of anemia.', 'Y', 'N', 7.8),
	('The X-Files', 'Kitsunegari', 5, 8, 'Yes', 'Yes', 'No', 4, 1, 1998, 'Pusher returns as Robert Patrick Modell escapes from the mental hospital and the FBI promptly organizes a manhunt, assuming that he will continue where he left off. But is he really trying to get revenge on Mulder, or does he want to warn him of another evil?', 'Y', 'N', 8),
	('The X-Files', 'Schizogeny', 5, 9, 'Yes', 'Yes', 'No', 11, 1, 1998, 'A therapist working with children from abusive families is found to be implanting them with the memories of her own abuse suffered at the hands of her late father, when one of her patients tries to kill his stepfather.', 'Y', 'N', 7.2),
	('The X-Files', 'Chinga', 5, 10, 'Yes', 'Yes', 'No', 8, 2, 1998, 'Master of Horror Stephen King\'s first effort at an X-File sees Scully\'s well deserved vacation going terribly wrong and landing her in a small Maine town where one of the residents is believed to be a witch, and her autistic daughter\'s doll has frighteningly evil powers.', 'Y', 'N', 7.8),
	('The X-Files', 'Kill Switch', 5, 11, 'Yes', 'Yes', 'No', 15, 2, 1998, 'A super-intelligent virus program is let loose on the internet and begins to grow and expand by itself, eventually killing its creator when he tries to eradicate it.', 'Y', 'N', 8.1),
	('The X-Files', 'Bad Blood', 5, 12, 'Yes', 'Yes', 'No', 22, 2, 1998, 'After Mulder chases down and kills a young man who he believes to be a vampire, the agents return to DC aware of the mistake they just made. Faced with a lawsuit from the family of the man, they recount each of their sides to the story leading up to the event. In the extremely humorous stories that follow we see how Scully and Mulder both perceive each other.', 'Y', 'N', 9.4),
	('The X-Files', 'Patient X', 5, 13, 'Yes', 'Yes', 'No', 1, 3, 1998, 'Mulder and Scully meet Cassandra Spender, a woman who claims to be a multiple abductee and wants to deliver a positive message about the aliens. Mulder\'s new found disbelief in extraterrestrial activity is enhanced while Scully forms a special bond with the woman. A series of group attacks against abductees take place and the shadowy Syndicate believes that a rebel alien resistance is attempting to destroy all their work.', 'Y', 'N', 8.5),
	('The X-Files', 'The Red And The Black', 5, 14, 'Yes', 'Yes', 'No', 8, 3, 1998, 'After the gathering at the abduction site where everyone is killed by the rebel bounty hunters, Cassandra Spender disappears and Mulder is blamed by her son, Jeffrey, who is an up-and-coming FBI agent. Meanwhile, the Syndicate is continuing their tests to create a vaccine for the Black Cancer and Marita Covarrubias becomes an unwilling test subject.', 'Y', 'N', 8.6),
	('The X-Files', 'Travelers', 5, 15, 'Yes', 'Yes', 'No', 29, 3, 1998, 'In 1990 Agent Fox Mulder visits an aging FBI Agent named Arthur Dales. He listens to a story of the agents assigned to a would-be X-File in the Cold War era of the 1950\'s and how Mulder\'s father was connected to a series of strange deaths.', 'Y', 'N', 7.6),
	('The X-Files', 'Mind\'s Eye', 5, 16, 'Yes', 'Yes', 'No', 19, 4, 1998, 'Mulder and Scully try to get answers out of a stubborn blind woman found at a murder scene who may have the ability to look through the killer\'s eyes in her mind.', 'Y', 'N', 8),
	('The X-Files', 'All Souls', 5, 17, 'Yes', 'Yes', 'No', 26, 4, 1998, 'Scully faces her Catholic faith and the loss of her daughter Emily when she is asked to help a family whose adopted daughter was found dead in a position that looked like she was struck down by God himself.', 'Y', 'N', 7.7),
	('The X-Files', 'The Pine Bluff Variant', 5, 18, 'Yes', 'Yes', 'No', 3, 5, 1998, 'Scully fears that Mulder has gone to the other side when she sees him assisting a federal suspect escape custody. In truth he has infiltrated a terrorist group testing a deadly biological weapon that can eat through a person\'s flesh.', 'Y', 'N', 8.4),
	('The X-Files', 'Folie A Deux', 5, 19, 'Yes', 'Yes', 'No', 10, 5, 1998, 'Mulder is held hostage inside an office where a man claims his boss is a monster and has clouded all their minds while he turns them into zombies one by one, which is disbelieved until Mulder opens his mind and allows himself to see it too.', 'Y', 'N', 8.8),
	('The X-Files', 'The End', 5, 20, 'Yes', 'Yes', 'No', 17, 5, 1998, 'The Cigarette-Smoking Man returns as Mulder investigates the attempted assassination of a young boy with psychic powers who may be the proof that he has looked for all his life.', 'Y', 'N', 9),
	('The X-Files', 'The Beginning', 6, 1, 'Yes', 'Yes', 'No', 8, 11, 1998, 'Mulder is less than thrilled when an Office of Professional Conduct board refuses to reassign him and Scully to The X-Files and even more so when he learns that Agent Spender and Agent Fowley have become their successors. When Gibson Praise reappears and comes to them for help, Mulder and Scully attempt to continue their quest undercover despite having fewer friends and less access and protection than ever before.', 'Y', 'N', 8.4),
	('The X-Files', 'Drive', 6, 2, 'Yes', 'Yes', 'No', 15, 11, 1998, 'Mulder is trapped in a car with a man who has developed a serious ear condition which can only be suppressed by driving west at high speeds. As Scully tries to find the cause and a cure for the problem, Mulder and the man get closer and closer to the ocean.', 'Y', 'N', 8.7),
	('The X-Files', 'Triangle', 6, 3, 'Yes', 'Yes', 'No', 22, 11, 1998, 'Mulder goes to the Bermuda Triangle when he learns that the Queen Anne, a British luxury liner which disappeared during WWII, has reappeared in the middle of the Sargasso Sea. Mulder\'s boat is wrecked and after floating in the water, he is hauled aboard the ship which has just been hijacked by the Nazis searching for the man who will build the atom bomb. Mulder tries to convince the crew that they have traveled into the future, but evidence further suggests that it is he who is back in the past.', 'Y', 'N', 8.9),
	('The X-Files', 'Dreamland - 1', 6, 4, 'Yes', 'Yes', 'No', 29, 11, 1998, 'Mulder tries to convince the crew that they have traveled into the future, but evidence further suggests that it is he who is back in the past.', 'Y', 'N', 9.1),
	('The X-Files', 'Dreamland - 2', 6, 5, 'Yes', 'Yes', 'No', 6, 12, 1998, 'Mulder is thrown in jail at the Area 51 compound but is released when it is discovered that the flight data recorder he stole was a fake. Scully comes to her senses and realizes that the Mulder she sees isn\'t who he really is and heads back to Nevada to help the real Mulder. Meanwhile, the mechanism that caused the body swap is rapidly snapping back, undoing everything in its wake, and Mulder and his alter ego must race to put themselves back where they belong.', 'Y', 'N', 9),
	('The X-Files', 'How The Ghosts Stole Christmas', 6, 6, 'Yes', 'Yes', 'No', 13, 12, 1998, 'Mulder talks Scully into investigating a haunted house on Christmas Eve where several couples have met their fate on that very night. While there, they encounter endless tricks and traps set by a ghostly couple who originally made a lovers suicide pact in the house. The ghosts try to convince Mulder and Scully to kill each other.', 'Y', 'N', 8.4),
	('The X-Files', 'Terms Of Endearment', 6, 7, 'Yes', 'Yes', 'No', 3, 1, 1999, 'After a scan of a couple\'s unborn child is found to have strange growths protruding from the head and back, the fetus is taken from inside the mother by a demon creature while she is asleep. Mulder heads to investigate after Agent Spender dismisses the claims, and discovers that the father is actually a demon who wants to have a normal child.', 'Y', 'N', 8),
	('The X-Files', 'The Rain King', 6, 8, 'Yes', 'Yes', 'No', 10, 1, 1999, 'Strange weather phenomena in a small town leads Mulder to believe that a weatherman\'s deep emotions and unspoken love toward his workmate are becoming real in the form of snow and tornadoes.', 'Y', 'N', 7.6),
	('The X-Files', 'S.R. 819', 6, 9, 'Yes', 'Yes', 'No', 17, 1, 1999, 'Mulder and Scully have 24 hours to save A.D. Skinner from being killed by a biologically engineered disease. The disease appears to be created by a shadowy government organization, but in order to save Skinner\'s life they must determine who wants him dead and why. With Skinner\'s condition worsening, Mulder seeks assistance from Senator Matheson, who he hopes can provide some answers and help him to find a cure.', 'Y', 'N', 8.2),
	('The X-Files', 'Tithonus', 6, 10, 'Yes', 'Yes', 'No', 24, 1, 1999, 'Assistant Director Kersh tries to tear Scully and Mulder apart when he partners Scully with a New York agent investigating Alfred Fellig, a freelance police photographer who conveniently shows up to document the scene of a death as soon as it happens. While the young hotshot agent is convinced that Fellig is murdering the people, Scully has other (paranormal) theories.', 'Y', 'N', 8.5),
	('The X-Files', 'Two Fathers', 6, 11, 'Yes', 'Yes', 'No', 7, 2, 1999, 'While the Cigarette-Smoking Man recites to an unseen listener everything about the work of the Syndicate involving a global conspiracy in cooperation with an alien species, Cassandra Spender reappears and is pursued by the scientists who would rather kill her than keep her alive. Cassandra runs to Mulder\'s apartment and demands that he shoot her because she is the culmination of 50 years work - a living alien/human hybrid - and colonization will begin if the aliens find out about her.', 'Y', 'N', 8.9),
	('The X-Files', 'One Son', 6, 12, 'Yes', 'Yes', 'No', 14, 2, 1999, 'The Cigarette-Smoking Man reveals all the government secrets from the past 50 years in order for his son, Jeffery Spender, to join him in his work. Mulder learns that the final stage of the conspiracy will soon begin with the hybridization of the Syndicate members, and he must stop it from happening. Agent Spender deceives his father and arranges for Mulder and Scully to be reassigned to the X-Files, which doesn\'t sit too well with the Cigarette-Smoking Man.', 'Y', 'N', 9.1),
	('The X-Files', 'Agua Mala', 6, 13, 'Yes', 'Yes', 'No', 21, 2, 1999, 'Arthur Dales summons Mulder and Scully to his holiday home in Florida where he is concerned over the disappearance of his neighbors. Despite the raging hurricane, Mulder and Scully head out to investigate and discover several strange deaths caused by an octopus-like sea creature that swam in through the overflowing sewer system.', 'Y', 'N', 7.6),
	('The X-Files', 'Monday', 6, 14, 'Yes', 'Yes', 'No', 28, 2, 1999, 'A woman is forced to relive the same day over and over as she tries to prevent Mulder and Scully from being killed by her boyfriend during a bank robbery attempt. As the events restart again and again, Mulder\'s sense of Deja-vu grows stronger.', 'Y', 'N', 9),
	('The X-Files', 'Arcadia', 6, 15, 'Yes', 'Yes', 'No', 7, 3, 1999, 'On their first official case back on the X-Files, Mulder and Scully go undercover as a married couple at a prestigious planned community where several residents have recently disappeared after failing to comply with the rules and regulations.', 'Y', 'N', 8.7),
	('The X-Files', 'Alpha', 6, 16, 'Yes', 'Yes', 'No', 28, 3, 1999, 'A mysterious dog thought to be the last of a rare Asian breed is responsible for several murders which Mulder and Scully are investigating. Now the agents have to find a way to stop the dog before it kills again.', 'Y', 'N', 6.5),
	('The X-Files', 'Trevor', 6, 17, 'Yes', 'Yes', 'No', 11, 4, 1999, 'After a tornado rips through a prison camp, one of the inmates disappears from solitary confinement and the prison warden is killed. As Mulder and Scully track him, he appears to have the power to pass through solid matter while changing its composition.', 'Y', 'N', 7.5),
	('The X-Files', 'Milagro', 6, 18, 'Yes', 'Yes', 'No', 18, 4, 1999, 'A writer living next to Mulder becomes obsessed with Scully and confesses to her that he is using her for a character in his novel. Scully finds herself strangely drawn to him even though he is now the prime suspect in the murder case that she and Mulder are investigating.', 'Y', 'N', 8.1),
	('The X-Files', 'The Unnatural', 6, 19, 'Yes', 'Yes', 'No', 25, 4, 1999, 'Mulder meets with Agent Arthur Dales\' brother (also named Arthur) and is told a tale of a talented negro baseball player from Roswell, New Mexico in the 1940\'s who may have been an alien that ran away from his colony because of his love for the game.', 'Y', 'N', 8.7),
	('The X-Files', 'Three Of A Kind', 6, 20, 'Yes', 'Yes', 'No', 2, 5, 1999, 'While on a stakeout of a Government Defense Convention in Las Vegas, The Lone Gunmen are reunited with Susanne Modeski, the mysterious woman who disappeared ten years earlier when they first met Agent Mulder.', 'Y', 'N', 8.2),
	('The X-Files', 'Field Trip', 6, 21, 'Yes', 'Yes', 'No', 9, 5, 1999, 'When the bodies of a couple who have been missing for less than a week are discovered to have been reduced to bone, Mulder suggests that recent paranormal phenomena in the area may have caused the accelerated decomposition.', 'Y', 'N', 8.8),
	('The X-Files', 'Biogenesis', 6, 22, 'Yes', 'Yes', 'No', 16, 5, 1999, 'Two scientists confer about each of their metal objects that were found in Africa and they theorize that the objects are pieces of a puzzle which could be undeniable proof that human, plant, and animal life did not originate on this planet. When one of the scientists is killed and the objects are stolen, the agents investigate and Mulder begins to experience severe neurological pain caused by the objects.', 'Y', 'N', 8.5),
	('The X-Files', 'The Sixth Extinction - 1', 7, 1, 'Yes', 'Yes', 'No', 7, 11, 1999, 'While Scully travels to Africa to piece together the meaning of the symbols on the spaceship beached on the Ivory Coast, Mulder is imprisoned by his own frenetic brain activity. He manages to get a message to Skinner who finds Kritschgau, and together they try to understand what is happening to Mulder before it is too late.', 'Y', 'N', 8.1),
	('The X-Files', 'The Sixth Extinction - 2 - Amor Fati', 7, 2, 'Yes', 'Yes', 'No', 14, 11, 1999, 'Scully frantically searches for a way to help her ailing partner without having anyone to turn to for help, while a catatonic Mulder\'s dreams lead him away from his mission and the X-Files to a place which he believes is a better life.', 'Y', 'N', 8.1),
	('The X-Files', 'Hungry', 7, 3, 'Yes', 'Yes', 'No', 21, 11, 1999, 'A monster who feeds on human brain matter tries to lead a normal life, but he soon cannot control his feelings of hunger.', 'Y', 'N', 8.1),
	('The X-Files', 'Millennium', 7, 4, 'Yes', 'Yes', 'No', 28, 11, 1999, 'As the year 2000 draws closer, the agents are up against a man from the Millennium Group who believes that he can bring about the end of the world on the 31st of December if he resurrects four former members from the dead. To gain more insight into the group and its practices, Mulder and Scully enlist criminal profiler Frank Black to assist them in the investigation.', 'Y', 'N', 8.1),
	('The X-Files', 'Rush', 7, 5, 'Yes', 'Yes', 'No', 5, 12, 1999, 'A young man who has gained the ability to move faster than the eye can see begins to use his new power to kill his enemies, including the local sheriff who happens to be his father.', 'Y', 'N', 7.6),
	('The X-Files', 'The Goldberg Variation', 7, 6, 'Yes', 'Yes', 'No', 12, 12, 1999, 'Mulder and Scully get caught in a real-life Rube Goldberg device when they meet Henry Weems, who just may be the luckiest man on Earth - except everyone around him doesn\'t seem to be that lucky.', 'Y', 'N', 8.5),
	('The X-Files', 'Orison', 7, 7, 'Yes', 'Yes', 'No', 9, 1, 2000, 'Reverend Orison hopes to save Donnie Pfaster\'s soul by helping him break out of prison, but Donnie immediately plans to go after the victim that once escaped him... Scully.', 'Y', 'N', 7.9),
	('The X-Files', 'The Amazing Maleeni', 7, 8, 'Yes', 'Yes', 'No', 16, 1, 2000, 'When a small-time magician performs a trick where it appears that he turns his head all the way around but is then found in his van dead with his head neatly sawed off, Mulder and Scully suspect he was murdered and get caught up in an intricate scheme planned by two magicians trying to rob a bank.', 'Y', 'N', 8.3),
	('The X-Files', 'Signs And Wonders', 7, 9, 'Yes', 'Yes', 'No', 23, 1, 2000, 'Snakes are killing the unrighteous, but Mulder and Scully doubt that this is a case of divine intervention.', 'Y', 'N', 6.9),
	('The X-Files', 'Sein Und Zeit', 7, 10, 'Yes', 'Yes', 'No', 6, 2, 2000, 'A young girl inexplicably disappears from her home, and Mulder requests the case even though it is a full FBI matter, not just an X-File. When Mulder takes some outrageous leaps to convince the girl\'s parents that she will be found, Scully fears that Mulder is becoming too personally involved with the case because of his sister\'s abduction.', 'Y', 'N', 8.3),
	('The X-Files', 'Closure', 7, 11, 'Yes', 'Yes', 'No', 13, 2, 2000, 'After arresting the murderer of Amber-Lynn LaPierre and discovering a mass grave site containing the bodies of dozens of missing children, a man comes to Mulder and claims to have had visions of other victims who aren\'t buried at the site. Despite Scully\'s objections, he takes Mulder on a journey which reveals what truly happened to his sister.', 'Y', 'N', 8.4),
	('The X-Files', 'X-Cops', 7, 12, 'Yes', 'Yes', 'No', 20, 2, 2000, 'A Los Angeles police officer who is being filmed for the show COPS is attacked by a strange monster and Mulder and Scully are investigating the case. Scully is wary of having their faces put on national television but Mulder welcomes the publicity.', 'Y', 'N', 8.6),
	('The X-Files', 'First Person Shooter', 7, 13, 'Yes', 'Yes', 'No', 27, 2, 2000, 'The Lone Gunmen call Mulder and Scully to a virtual reality development lab where they learn that one of the program testers was killed inside the computer generated game environment by the digital image of a woman. Needing to get his yah-yah\'s, Mulder enters the game to fight the woman, but Scully must step in to save him.', 'Y', 'N', 6.5),
	('The X-Files', 'Theef', 7, 14, 'Yes', 'Yes', 'No', 12, 3, 2000, 'Mulder and Scully suspect that hexcraft is the source of threats against a doctor\'s family.', 'Y', 'N', 7.6),
	('The X-Files', 'En Ami', 7, 15, 'Yes', 'Yes', 'No', 19, 3, 2000, 'The Cigarette-Smoking Man offers to show Scully the cure for all diseases if she travels with him, but on one condition:  Mulder must not know about her trip.', 'Y', 'N', 8.3),
	('The X-Files', 'Chimera', 7, 16, 'Yes', 'Yes', 'No', 2, 4, 2000, 'As Mulder investigates a missing person case with a key feature being a menacing raven, he learns to enjoy the creature comforts of a well-tended home while Scully must tough it out on an uncomfortable stakeout.', 'Y', 'N', 7.8),
	('The X-Files', 'All Things', 7, 17, 'Yes', 'Yes', 'No', 9, 4, 2000, 'A series of coincidences leads Scully to a married man she had an affair with during medical school but left him to protect his family.', 'Y', 'N', 7.1),
	('The X-Files', 'Brand X', 7, 18, 'Yes', 'Yes', 'No', 16, 4, 2000, 'While protecting a man due to testify against the Morley cigarette company, Skinner is horrified when the witness dies mysteriously. What the agents soon discover is that a new brand of cigarette has a dangerous secret.', 'Y', 'N', 7.8),
	('The X-Files', 'Hollywood A.D.', 7, 19, 'Yes', 'Yes', 'No', 30, 4, 2000, 'Mulder and Scully watch a movie with themselves as characters and are thoroughly disgusted at how they and their case are portrayed on the big screen. They recount how 18 months earlier they were followed around by a Hollywood producer while investigating a case concerning The Lazarus Bowl - a mythical piece of pottery reputed to have inscribed on it the words that Jesus Christ spoke when he raised Lazarus from the dead.', 'Y', 'N', 7.6),
	('The X-Files', 'Fight Club', 7, 20, 'Yes', 'Yes', 'No', 7, 5, 2000, 'Mulder and Scully cross paths with two women who are identical and have followed each other across 17 states in the last three years, causing chaos and mayhem wherever they are.', 'Y', 'N', 6.2),
	('The X-Files', 'Je Souhaite', 7, 21, 'Yes', 'Yes', 'No', 14, 5, 2000, 'Mulder and Scully discover a genie in a rug who, after 500 years of granting wishes, has come to the conclusion that people are still as greedy and self-centered as they always have been, and she begins to corrupt the wishes she grants if they are not specific enough.', 'Y', 'N', 8.7),
	('The X-Files', 'Requiem', 7, 22, 'Yes', 'Yes', 'No', 21, 5, 2000, 'Mulder and Scully return to the town of their first X-Files investigation where a UFO has crashed in the forest. The Cigarette-Smoking Man arranges for Krycek to be released from prison in order for him to make contact with the aliens and begin rebuilding the \'Project\', while Scully\'s health appears to be taking a turn.', 'Y', 'N', 8.9),
	('The X-Files', 'Within', 8, 1, 'Yes', 'Yes', 'No', 5, 11, 2000, 'Newly appointed Deputy Director Kersh organizes a manhunt for Mulder and assigns Agent John Doggett to head the team. Scully and Skinner go along with the investigation but are warned by Kersh that they will be fired if anything is said about aliens. Scully, along with the Lone Gunmen, surmise that the Bounty Hunter is trying to erase all evidence of abductions, and they realize that he may be going after Gibson Praise, who is now living at a school in Arizona. Agent Doggett comes to the same conclusion and his team race Scully and Skinner to the school where they find Mulder trying to kidnap Gibson.', 'Y', 'N', 8.5),
	('The X-Files', 'Without', 8, 2, 'Yes', 'Yes', 'No', 12, 11, 2000, 'As the search for Mulder intensifies in the Arizona desert, Gibson Praise leads Scully to believe that she is truly closer to her target. Meanwhile, A.D. Kersh informs Agent Doggett that he has been assigned as Mulder\'s successor on the X-Files.', 'Y', 'N', 8.5),
	('The X-Files', 'Patience', 8, 3, 'Yes', 'Yes', 'No', 19, 11, 2000, 'While tackling his first X-File case about a series of gruesome murders surrounding a bat-like creature, Doggett quickly learns that his investigative techniques are somewhat dissimilar to Scully\'s.', 'Y', 'N', 7.8),
	('The X-Files', 'Roadrunners', 8, 4, 'Yes', 'Yes', 'No', 26, 11, 2000, 'Scully evades Doggett\'s help in investigating a vicious murder in a remote area of Utah, and she is trapped in the small town by a religious cult that believe a slug-like creature is the second coming of God who needs a human host to survive.', 'Y', 'N', 8.4),
	('The X-Files', 'Invocation', 8, 5, 'Yes', 'Yes', 'No', 3, 12, 2000, 'In 1990 a little boy inexplicably disappeared from his crowded school playground and was never seen again until now, ten years later, and he hasn\'t aged a day.', 'Y', 'N', 7.9),
	('The X-Files', 'Redrum', 8, 6, 'Yes', 'Yes', 'No', 10, 12, 2000, 'A prominent lawyer wakes to find himself in jail and about to be prosecuted for the murder of his wife. He has no memory of this event however, and when the days begin to regress backward towards the murder, he realizes that he has been given a second chance.', 'Y', 'N', 8.5),
	('The X-Files', 'Via Negativa', 8, 7, 'Yes', 'Yes', 'No', 17, 12, 2000, 'Working without Scully\'s input, Doggett and Skinner try to stop the mysterious murder spree of a drug-induced religious cult leader, and it becomes clear that the man can enter the dreams of the people he knows and can kill them in their sleep.', 'Y', 'N', 8),
	('The X-Files', 'Surekill', 8, 8, 'Yes', 'Yes', 'No', 7, 1, 2001, 'When a real estate agent is shot inside a prison cell by someone who apparently fired from the roof, Scully and Doggett track him to two exterminators, one of whom has x-ray vision.', 'Y', 'N', 7.1),
	('The X-Files', 'Salvage', 8, 9, 'Yes', 'Yes', 'No', 14, 1, 2001, 'A man whose blood is rapidly changing into metal alloy enacts revenge on those who caused his condition.', 'Y', 'N', 7.1),
	('The X-Files', 'Badlaa', 8, 10, 'Yes', 'Yes', 'No', 21, 1, 2001, 'An Indian mystic whose son died in a chemical plant accident smuggles himself into the United States and takes his revenge on two families in suburban Washington, D.C.', 'Y', 'N', 7.3),
	('The X-Files', 'The Gift', 8, 11, 'Yes', 'Yes', 'No', 4, 2, 2001, 'Doggett comes upon an old case that Mulder kept secret from Scully and he follows up the investigation, hoping to find a possible connection to Mulder\'s disappearance.', 'Y', 'N', 8.1),
	('The X-Files', 'Medusa', 8, 12, 'Yes', 'Yes', 'No', 11, 2, 2001, 'Scully and Doggett must race against the clock to investigate and fight off a contagion lurking in the subway tunnels of Boston.', 'Y', 'N', 7.7),
	('The X-Files', 'Per Manum', 8, 13, 'Yes', 'Yes', 'No', 18, 2, 2001, 'When Scully and Doggett are contacted by a man who claims his wife was murdered shortly after giving birth to an alien baby, Scully digs deeper into reports of alien fertilization on humans, and she begins to question her own pregnancy and its conception.', 'Y', 'N', 8.2),
	('The X-Files', 'This Is Not Happening', 8, 14, 'Yes', 'Yes', 'No', 25, 2, 2001, 'When Teresa Hoese (the woman Scully and Mulder met the previous spring in Oregon just before Mulder was abducted) is found in a desert after enduring alien testing, Doggett alerts Scully that this could have something to do with Mulder and his whereabouts. Skinner joins them and they travel to the hospital where Teresa is clinging to life by a thread, and Scully realizes that this is exactly what\'s going on with Mulder.', 'Y', 'N', 8.6),
	('The X-Files', 'Deadalive', 8, 15, 'Yes', 'Yes', 'No', 1, 4, 2001, 'Shortly after Mulder is buried, Billy Miles is found very dead, but he somehow comes back to life. Skinner and Scully put all their hopes into digging up Mulder and discovering that he too, is still alive. As Mulder lies in the hospital without indication that he is going to fully recover, Krycek comes to Skinner and offers him a vaccine to the virus that has infected Mulder, but the cost of the vaccine is that Skinner has to kill Scully\'s unborn child.', 'Y', 'N', 8.4),
	('The X-Files', 'Three Words', 8, 16, 'Yes', 'Yes', 'No', 8, 4, 2001, 'Mulder\'s request for reassignment to the X-Files is denied by Kersh, who hopes that Mulder will simply quit the FBI. When a census worker is killed on the White House lawn trying to get information to the President, Mulder gets in over his head trying to discover what the man knew.', 'Y', 'N', 8.4),
	('The X-Files', 'Empedocles', 8, 17, 'Yes', 'Yes', 'No', 15, 4, 2001, 'Special Agent Reyes enlists Mulder\'s help in investigating a supernatural killer\'s connection to the unsolved murder of Agent Doggett\'s son, Luke.', 'Y', 'N', 7.5),
	('The X-Files', 'Vienen', 8, 18, 'Yes', 'Yes', 'No', 22, 4, 2001, 'Mulder and Doggett are reluctantly thrown together to investigate several deaths aboard an oil rig, and Mulder becomes convinced that the rig is really carrying the black oil alien.', 'Y', 'N', 8.2),
	('The X-Files', 'Alone', 8, 19, 'Yes', 'Yes', 'No', 6, 5, 2001, 'While Scully takes maternity leave, Doggett is partnered with a young agent who is fascinated with the X-Files and has followed Mulder and Scully\'s careers. She and Doggett investigate the death of an old man and the disappearance of his son, but when they disappear as well Mulder heads out to search for them.', 'Y', 'N', 8.2),
	('The X-Files', 'Essence', 8, 20, 'Yes', 'Yes', 'No', 13, 5, 2001, 'Mulder and Doggett join forces to investigate the arson attack on a genetics lab where one of the doctors suspected of experimenting with alien impregnation is killed. They encounter Billy Miles, who has been changed into an alien replicant after his recent abduction and is attempting to erase evidence of the tests. When a woman helping Scully out at home is found to be a part of the conspiracy, the agents, along with Monica Reyes and Alex Krycek, know they must protect Scully and her baby from Billy Miles and get her out of the city.', 'Y', 'N', 8.7),
	('The X-Files', 'Existence', 8, 21, 'Yes', 'Yes', 'No', 20, 5, 2001, 'Mulder, Doggett and Skinner attempt to fight off the alien replicants, and they find a connection to the conspiracy that leads into the FBI while Reyes and Scully head to a remote farm to safeguard the birth of Scully\'s child.', 'Y', 'N', 9),
	('The X-Files', 'Nothing Important Happened Today - 1', 9, 1, 'Yes', 'Yes', 'No', 11, 11, 2001, 'Agent Doggett investigates the death of an EPA official after his car is forced off a bridge by a woman he picked up. He asks for assistance on the case from Scully, who has returned to her teaching position at the FBI Academy in Quantico.', 'Y', 'N', 7.6),
	('The X-Files', 'Nothing Important Happened Today - 2', 9, 2, 'Yes', 'Yes', 'No', 18, 11, 2001, 'Doggett catches up with Shannon McMahon, the woman who the EPA official picked up. She claims to be a super solider and that the people she has killed were poisoning the water supply, and she wants Doggett to expose the truth.', 'Y', 'N', 7.7),
	('The X-Files', 'Daemonicus', 9, 3, 'Yes', 'Yes', 'No', 2, 12, 2001, 'Doggett and Reyes investigate the murder of a couple in West Virginia that has all the signs of a satanic ritual killing. They link the murder to a doctor who is incarcerated in a mental institute, and Doggett becomes convinced that the doctor is orchestrating the crimes from within the hospital.', 'Y', 'N', 7.6),
	('The X-Files', '4-D', 9, 4, 'Yes', 'Yes', 'No', 9, 12, 2001, 'During a stakeout of murderer Irwin Lukesh, Doggett sees Reyes attacked by Lukesh, but then we see Reyes and Doggett in her apartment, apparently both fine. Elsewhere at the same time, Doggett is shot and Lukesh identifies Reyes as the shooter. While Reyes is asked for her badge and gun by A.D. Follmer, and Doggett lies in hospital near death, the conflicting circumstances of the stakeout and Doggett\'s shooting do not add up and it becomes clear that Lukesh possesses the power to switch between parallel universes and alter the events in each.', 'Y', 'N', 8.1),
	('The X-Files', 'Lord Of The Flies', 9, 5, 'Yes', 'Yes', 'No', 16, 12, 2001, 'When a stunt on a local cable reality show goes horribly wrong resulting in a man\'s death, Doggett and Reyes investigate. But when flies pour out of the victims eye sockets, they find themselves relying on Scully\'s expertise and ask her to join the investigation.', 'Y', 'N', 7),
	('The X-Files', 'Trust No 1', 9, 6, 'Yes', 'Yes', 'No', 6, 1, 2002, 'Scully is approached by a couple who claim their baby has the same abilities as William and have information about the super soldier program; however, they will only talk to Mulder, believing him the only person who can make the connections and uncover the truth. Scully is forced into an awkward situation when she has to decide whether to put Mulder\'s life in more danger even though she desperately wants to see him.', 'Y', 'N', 7.8),
	('The X-Files', 'John Doe', 9, 7, 'Yes', 'Yes', 'No', 13, 1, 2002, 'Scully and Reyes join forces to try and find Doggett when he goes missing. Doggett has his own problems, having woken up in jail in Mexico suffering from amnesia. With no knowledge of who he is, Doggett is befriended by a local who soon has him working smuggling illegal immigrants across the border.', 'Y', 'N', 7.9),
	('The X-Files', 'Hellbound', 9, 8, 'Yes', 'Yes', 'No', 27, 1, 2002, 'Agent Reyes takes the lead while investigating an X-file case, surrounding a man found skinned alive after having visions of seeing other people appearing skinned alive. Reyes calls on Scully\'s expertise to help on the investigation, which pays off when Scully finds a link to a case from 1960.', 'Y', 'N', 7.4);
INSERT INTO `t1` (`serial`, `name`, `season`, `episode`, `seena`, `seens`, `sub`, `day`, `month`, `year`, `summary`, `pics`, `ppt`, `rating`) VALUES
	('The X-Files', 'Provenance', 9, 9, 'Yes', 'Yes', 'No', 3, 3, 2002, 'When pieces of the spaceship beached in Africa resurface, the conspiracy within the FBI attempts to hide the information from the X-Files, especially the one person for whom the pieces have a special significance - Scully.   When Doggett and Reyes discover that Scully and her child have been put in great danger, they race to protect her and William from the evil forces pursuing him, and Scully is forced to take drastic measures to protect her child.', 'Y', 'N', 7.7),
	('The X-Files', 'Providence', 9, 10, 'Yes', 'Yes', 'No', 10, 3, 2002, 'Scully is anxious to recover William from his kidnappers and takes matters into her own hands when the FBI\'s attempts to assist in the investigation are less than helpful. With the help of the Lone Gunmen, Scully discovers terrifying information about her child\'s captors, and is once again forced to confront the mystery regarding the sinister interest in her son.', 'Y', 'N', 7.5),
	('The X-Files', 'Audrey Pauley', 9, 11, 'Yes', 'Yes', 'No', 17, 3, 2002, 'After a car accident, Reyes finds herself in a very gray area, while Doggett desperately denies doctors\' diagnoses about his partner, who witnesses a strange disappearance.', 'Y', 'N', 7.8),
	('The X-Files', 'Underneath', 9, 12, 'Yes', 'Yes', 'No', 31, 3, 2002, 'Scully, Doggett and Reyes investigate an old case that Doggett worked on as a cop in Brooklyn, dubbed \'The Screwdriver Killer\'. They try to determine whether the man who was convicted and has just been released from prison was actually the man responsible for the murders.', 'Y', 'N', 7.3),
	('The X-Files', 'Improbable', 9, 13, 'Yes', 'Yes', 'No', 7, 4, 2002, 'When Reyes uses numerology to connect the murders of several women to an obsessed serial killer, she and Scully become trapped with a mysterious checker-playing man who may or may not be the killer.', 'Y', 'N', 7.6),
	('The X-Files', 'Scary Monsters', 9, 14, 'Yes', 'Yes', 'No', 14, 4, 2002, 'Agent Harrison talks Doggett and Reyes into investigating a boy\'s claim that monsters killed his mother, who was officially determined to have stabbed herself repeatedly.', 'Y', 'N', 7.6),
	('The X-Files', 'Jump The Shark', 9, 15, 'Yes', 'Yes', 'No', 21, 4, 2002, 'The agents ask the Lone Gunmen to help find their friendly foe Yves Adele Harlow after former Area 51 Man-In-Black Morris Fletcher claims she is one of the super-soldiers.', 'Y', 'N', 7.6),
	('The X-Files', 'William', 9, 16, 'Yes', 'Yes', 'No', 28, 4, 2002, 'Doggett catches someone in the X-files office trying to steal documents pertaining to Mulder\'s sister. The intruder is a severely scarred man who blames his disfigurement on Government conspirators. He claims the source of that information - and, in fact, the one who helped him gain entry - is Mulder. Although he refuses to divulge the missing agent\'s whereabouts, the mystery man has enough knowledge of the X-files and its history to lead Doggett to suspect that he just might be Mulder himself. Scully\'s fears for the safety of her son are elevated when he is injected with an unknown substance. With the mystery surrounding William becoming even darker, Scully must allow herself to send him away for his own safety.', 'Y', 'N', 8),
	('The X-Files', 'Release', 9, 17, 'Yes', 'Yes', 'No', 5, 5, 2002, 'When an FBI cadet with amazing profiling skills approaches Doggett, Reyes, and Scully with a lead on a suspect in a series of recent murders, he claims the same killer is responsible for the death of Doggett\'s son. The agents find themselves wondering if his knowledge of the deaths is because of his obsession with the cases he has studied at Quantico, or if he is in some way involved in the murders.', 'Y', 'N', 8.4),
	('The X-Files', 'Sunshine Days', 9, 18, 'Yes', 'Yes', 'No', 12, 5, 2002, 'Doggett and Reyes investigate a murder outside the house that the original Brady Bunch series was filmed in. The house is owned by a man named Oliver who is obsessed with the show and has rigged the house into a series of traps and changing appearances to look like the Brady house.', 'Y', 'N', 7.9),
	('The X-Files', 'The Truth - 1', 9, 19, 'Yes', 'Yes', 'No', 19, 5, 2002, 'After not knowing Fox Mulder\'s whereabouts for the last year, A.D. Skinner and Agent Scully learn he\'s being held for the murder of a military man he couldn\'t possibly have killed: Knowle Rohrer, one of the government\'s secret super-soldiers. With Skinner acting as Mulder\'s defense, people who Mulder has dealt with during his last nine years as an FBI agent testify on his behalf. But the military tribunal isn\'t interested in the truth. ', 'Y', 'N', 8.5),
	('The X-Files', 'The Truth - 2', 9, 20, 'Yes', 'Yes', 'No', 19, 5, 2002, 'When an unexpected person comes to Mulder\'s rescue, Mulder refuses to slip north over the border to safety. Instead, he heads southwest to the Anasazi ruins of New Mexico seeking a mysterious wise man who the Indians call \'The Keeper of the Truth\'.', 'Y', 'N', 8.5),
	('The X-Files', 'My Struggle - 1', 10, 1, 'Yes', 'Yes', 'No', 24, 1, 2016, 'Fox Mulder and Dana Scully have been contacted by Tad O\'Malley, a popular conspiracy theorist web-TV show host who believes he has uncovered a significant government conspiracy. With the assistance of FBI Asst. Dir. Walter Skinner, O\'Malley seeks to enlist the help of former X-Files agents Mulder and Scully, who have since severed ties with the FBI. Through O\'Malley they are introduced to Sveta, a possible alien abductee who shares shocking information with them that will challenge everything that Mulder has ever believed about the existence of aliens and the government\'s role in covering them up.', 'Y', 'N', 8),
	('The X-Files', 'Founder\'s Mutation', 10, 2, 'Yes', 'Yes', 'No', 25, 1, 2016, 'A scientist commits suicide, and Mulder and Scully investigate what unseen force may have driven him to it. They uncover a laboratory where extreme genetic experimentation has been going on for decades. The breeding subjects possess unexpected and dangerous powers, and harbor deep resentments.', 'Y', 'N', 8.1),
	('The X-Files', 'Mulder And Scully Meet The Were-Monster', 10, 3, 'Yes', 'Yes', 'No', 1, 2, 2016, 'A dead body is found in the woods. Mulder and Scully try to find out whether it was an animal attack, a serial killer or just a strange creature. Meanwhile, Mulder is able to confront some of his own demons about feeling disillusioned with his life\'s work.', 'Y', 'N', 8),
	('The X-Files', 'Home Again', 10, 4, 'Yes', 'Yes', 'No', 8, 2, 2016, 'Mulder and Scully are sent to investigate the murder of a city official, which no human could have committed. Scully deals with a personal tragedy, which brings up old feelings about the child she gave up for adoption.', 'Y', 'N', 7.4),
	('The X-Files', 'Babylon', 10, 5, 'Yes', 'Yes', 'No', 15, 2, 2016, 'An art gallery that\'s showing potentially offensive artwork is bombed, and Mulder and Scully try to communicate with the comatose bomber to prevent a future attack. A pair of younger FBI agents on the case push Mulder and Scully to examine their own beliefs.', 'Y', 'N', 6.2),
	('The X-Files', 'My Struggle - 2', 10, 6, 'Yes', 'Yes', 'No', 22, 2, 2016, 'The investigations that Mulder and Scully began with Tad O\'Malley have awakened powerful enemies. A panic begins as people all over the country suddenly start falling ill, and Scully looks for a cure. Mulder confronts the man whom he believes to be behind it all, but another figure from their past may prove to be the key.', 'Y', 'N', 7.1),
	('Tintin', 'The Crab With The Golden Claws - 1', 1, 1, 'Yes', 'Yes', 'NA', 2, 10, 1991, 'It all starts with Snowy\'s picking in garbage and finding a can with crab picture printed on it. Later that day he meets Thompson and Thomson and finds a piece of paper with the same crab picture in their possession. Tintin finds the word Karaboudjan at the back of the paper. He learns from the Thompson Twins that the drowned man in whose pocket they found the paper was a man from the ship called Karaboudjan. So he pays a visit to the ship and the first mate Allan senses that Tintin is upto something and tries to kill him. While cornered in a cabin, Tintin finds out the crab tins are full of Opium.Tintin finds Captain Haddock in the ship who is an honest man and easily satisfied with Whisky. So First Mate Allan just keeps him under his control with Whisky and uses the cargo to smuggle Opium. Tintin takes the Captain with him when he escapes from the ship.', 'Y', 'N', 7.6),
	('Tintin', 'The Crab With The Golden Claws - 2', 1, 2, 'Yes', 'Yes', 'NA', 9, 10, 1991, 'The plane Tintin and Haddock are using to escape crashes on Sahara and they got saved by the Lieutenant Delcourt\'s people.After several days journey they reach Bagghar, where they learn about Omar Ben Salaad who is the biggest trader in the city. The Thompson Twins charges him directly and Omar gets very angry. Just as he was throwing the Twins out Tintin and Captain finds Omar\'s celler full of opium in crab tins and Omar with a necklace with two gold crab claws. The story ends with the whole gang getting captured by the police, even First Mate Allan who tries to escape. Captain gives a speech about how a sailor\'s greatest enemy is Alchohol and gets ill by drinking a glass of water.', 'Y', 'N', 7.5),
	('Tintin', 'The Secret Of The Unicorn - 1', 1, 3, 'Yes', 'Yes', 'NA', 16, 10, 1991, 'It all starts with Tintin\'s finding a ship in the Old Street Market and buying it for Captain Haddock as a gift. Little he knows at that point that it will turn into a treasure hunt, because the model ship Unicorn is a copy of the ship that was commanded by Sir Francis Haddock, Captain\'s ancestor.', 'Y', 'N', 7.8),
	('Tintin', 'The Secret Of The Unicorn - 2', 1, 4, 'Yes', 'Yes', 'NA', 23, 10, 1991, 'Tintin is not the only one who knows the secret of the parchment hidden inside the ship\'s mast. The Byrd Brothers, antique dealers, also find a copy of the model ship Unicorn in their basement. They also start looking for the other two parchments, and they are not really the friendly kind. When their agent, Barnaby, tries to warn Tintin about the Byrd Brothers they try to kill him and also kidnap Tintin to find out about the parchments that they are missing. At last the parchments are recovered and the mystery solved.', 'Y', 'N', 7.7),
	('Tintin', 'Red Rackham\'s Treasure', 1, 5, 'Yes', 'Yes', 'NA', 30, 10, 1991, 'Tintin, Captain Haddock, Professor Calculus and Thomsom and Thompson go for a treasure hunt in this episode. At end of the book finally they find the treasure and Captain buys back his family estate Marlinspike Hall with help from Professor Calculus.', 'Y', 'N', 7.4),
	('Tintin', 'Cigars Of The Pharaoh - 1', 1, 6, 'Yes', 'Yes', 'NA', 6, 11, 1991, 'Tintin finds himself by chance entangled in a drug traffickers ring, which will take him all the way to India.', 'Y', 'N', 7.6),
	('Tintin', 'Cigars Of The Pharaoh - 2', 1, 7, 'Yes', 'Yes', 'NA', 13, 11, 1991, 'Tintin\'s plane crashes in India. Here he finds Sarcophagus who is effected by Rajaijah juice, poison of madness. He meets the Maharaj of Gaipajama whose family has been fighting the opium business. With the Maharaja\'s aid and by his presence of mind Tintin captures the whole gang and stops the Opium business in those areas.', 'Y', 'N', 7.6),
	('Tintin', 'The Blue Lotus - 1', 1, 8, 'Yes', 'Yes', 'NA', 20, 11, 1991, 'After the adventure of The Cigars of the Pharaoh, while Tintin spends some time with Maharaja of Gaipajama, a messanger comes from Shanghai, and before he could deliver his message, he gets effected by Rajaijah juice, the poison of madness. Only thing Tintin could get out of him is the name of the person, Mitsuhirato, who sent this messanger. Tintin leaves at once for Shanghai and there he meets Mr. Mitsuhirato. Mitsuhirato tells Tintin to go back to India because the Maharaja is in danger. Meantime someone keeps on saving Tintin from getting killed by some unknown person. Later Tintin finds this friend, who has been trying to save him, has been affected by the poison of madness. With a lot of unanswered questions Tintin leaves Sanghai. But on his way to Bombay he is kidnapped by Wang Chen-yee to explain the incidents. Here Tintin learns, the person who has been trying to save Tintin\'s life is Mr. Wang\'s son. Tintin also learns that Mitsuhirato is a Japanese secret agent in China.', 'Y', 'N', 7.4),
	('Tintin', 'The Blue Lotus - 2', 1, 9, 'Yes', 'Yes', 'NA', 27, 11, 1991, 'Tintin takes the chance of crossing the Japanese lines to have the poison analyzed even though there is a price for his head with the Japanese. Tintin passes the Japanese line in disguise and comes to Professor Fang Hsi-ying\'s house. While waiting there for very long time he learns that the Professor left with a gentleman called Mr. Rastapopoulos. While looking for the Professor, Tintin comes to Mr. Gibbons, who takes him to Dawson and Dawson turns him over to Mitsuhirato. But with Mr. Wang\'s help Tintin escapes and goes to Hukow where the ransom is to be paid for Professor Fang. On his way, he saves a orphan boy called Chang from flood water. They become friends very quickly and journey to Hukow together. There a cameraman tries to kill Tintin and Chang saves him. Tintin learns from the cameraman that the ransom letter is a false letter to send police to the wrong trail. Next Tintin goes to Mitsuhirato\'s house and finds out that they are going to attack Mr. Wang.', 'Y', 'N', 7.5),
	('Tintin', 'The Black Island - 1', 1, 10, 'Yes', 'Yes', 'NA', 9, 12, 1991, 'It all starts when Tintin tries to help a plane in trouble. The pilots shoot at him and run away. Tintin is hospitalized but starts his investigations as soon as he feels a little better. One day, Pushchov, who is the leader of a gang of forgerers and the person behind the plane incident, recognizes Tintin at a train station. Be boards the same train to try to get Tintin arrested for assault and burglary.After a few times of Thompson twins loosing Tintin and Tintin escaping them, Tintin finds a crashed plane on his way to Eastdown. He looks around for clues and finds a flying jacket with a few pieces of papers in its pocket, from which he figures out his next step. His investigation leads him to Dr. Muller\'s house where he gets caught in a man-trap.Muller tries to kill him which results in a fight, in the course of which the house catches fire. Muller escapes and Tintin is rescued by the firemen.', 'Y', 'N', 7.3),
	('Tintin', 'The Black Island - 2', 1, 11, 'Yes', 'Yes', 'NA', 16, 12, 1991, 'Tintin follows Muller and Ivan to Kiltoch. In Kiltoch he gets to know about Black Island where everyone forbids him to go because they think there is a beast there. However, this does not keep Tintin away. He discovers that the Black Island is the forgerers\' headquarters. He also discovers that the \'Beast\' is a huge ape called Ranko. On Tintin\'s notification, the police are able to apprehend the entire gang.', 'Y', 'N', 7.4),
	('Tintin', 'The Calculus Affair - 1', 1, 12, 'Yes', 'Yes', 'NA', 16, 12, 1991, 'Strange events at Marlin Spike Hall and the kidnapping of Professor Calculus send Tintin, Snowy and Captain Haddock on a dangerous rescue mission.', 'Y', 'N', 7.6),
	('Tintin', 'The Calculus Affair - 2', 1, 13, 'Yes', 'Yes', 'NA', 23, 12, 1991, 'Tintin and Haddock set out to rescue Professor Calculus.', 'Y', 'N', 7.6),
	('Tintin', 'The Shooting Star', 2, 1, 'Yes', 'Yes', 'NA', 6, 1, 1992, 'The Shooting Star is a story of an adventure to investigate a meteorite which falls toward earth. Tintin and a group of scientists sail out to the Arctic Ocean, where the meteorite falls, in the ship called Aurora with Captain Haddock. A separate expedition called Peary, financed by San Rico bank, also takes the same voyage, but their intention is to stop Aurora at any cost to get to the meteorite first. In this Adventure Tintin helps the scientists of Aurora by stopping the sabotages planned by Peary; get to the meteorite first to fly the flag and get a piece of the meteorite to the scientists.', 'Y', 'N', 6.9),
	('Tintin', 'The Broken Ear - 1', 2, 2, 'Yes', 'Yes', 'NA', 13, 1, 1992, 'In this adventure, Tintin goes to a jungle in San Theodoros, South America to find an Arumbaya Fetish which has been stolen from a Museum. Two other people, Ramon and Alonso are also after the Fetish because they know that a diamond is hidden in it. Tintin gets stuck in a revolution in San Theodoros but manages to escape from there.', 'Y', 'N', 7.6),
	('Tintin', 'The Broken Ear - 2', 2, 3, 'Yes', 'Yes', 'NA', 20, 1, 1992, 'Eventually, he arrives at the village of the Arumbayas and finds the long-lost explorer Ridgewell, who is believed to be dead for many years. Ridgewell tells him the story of the fetish, which is how Tintin gets to know about the diamond. On his way out of the jungle, Tintin runs into Alonso and Ramon who try to kill him. They get into a fight; the fetish breaks and the diamond falls in the water. Tintin retrieves the fetish from his current owner and takes it back to the museum.', 'Y', 'N', 7.5),
	('Tintin', 'King Ottokar\'s Sceptre - 1', 2, 4, 'Yes', 'Yes', 'NA', 27, 1, 1992, 'Tintin finds a briefcase at the Park and goes to return it to its owner, professor Alembick, who is a sigillographer. The professor is invited to Syldavia to study the royal seals. On Tintin\'s way out Tintin overhears his name in a conversation. Tintin follows one of the men and goes to a Syldavian restaurant where he overhears some more conversation concerning Professor Alembick\'s invitation to the Syldavia. That night Tintin gets a strange phone call from a man who wants to meet him about some important issue. However, when Tintin opens the door, the man drops senseless to the ground. When he comes around, Tintin finds that he is sufferring from amnesia. Intrigued by these incidents, Tintin decides to become the Professor\'s secretary and accompanies him to Syldavia. On the plane, Tintin suspects that the Professor he is traveling with is an imposter but is unable to prove it. They have to change planes and the pilot of the second plane tries to kill Tintin by ejecting his seat from the plane, but Tintin is saved by falling into a cart filled with hay.', 'Y', 'N', 7.6),
	('Tintin', 'King Ottokar\'s Sceptre - 2', 2, 5, 'Yes', 'Yes', 'NA', 3, 2, 1992, 'Tintin and Snowy must recover the lost scepter of King Ottokar before the rightful King is forced to abdicate by greedy forces.', 'Y', 'N', 7.6),
	('Tintin', 'Tintin In Tibet - 1', 2, 6, 'Yes', 'Yes', 'NA', 6, 4, 1992, 'Tintin, Snowy, Captain Haddock and Professor Calculus are taking it easy on a vacation. Tintin receives a letter from Chang saying that he will be going to Kathmandu to visit his foster-uncle, and the next day, Tintin reads about a \'plane crash; the \'plane he is sure Chang boarded. He and Captain Haddock immediately leave for Tibet via India, for the crash site. The sherpas escorting them abandon the party out of fear for the Abominable Snowman, the Yeti, all except Tharkey.', 'Y', 'N', 7.6),
	('Tintin', 'Tintin In Tibet - 2', 2, 7, 'Yes', 'Yes', 'NA', 13, 4, 1992, 'Tintin, Snowy, Captain Haddock and Professor Calculus are taking it easy on a vacation. Tintin receives a letter from Chang saying that he will be going to Kathmandu to visit his foster-uncle, and the next day, Tintin reads about a \'plane crash; the \'plane he is sure Chang boarded. He and Captain Haddock immediately leave for Tibet via India, for the crash site. The sherpas escorting them abandon the party out of fear for the Abominable Snowman, the Yeti, all except Tharkey. The search takes them to a monastery and to the cave of the Yeti from where they finally rescue Chang.', 'Y', 'N', 7.5),
	('Tintin', 'Tintin And The Picaros - 1', 2, 8, 'Yes', 'Yes', 'NA', 20, 4, 1992, 'Tintin walks into a dangerous trap after three of his friends are falsely arrested in South America.', 'Y', 'N', 7.5),
	('Tintin', 'Tintin And The Picaros - 2', 2, 9, 'Yes', 'Yes', 'NA', 27, 4, 1992, 'Tintin gets caught up in a South America trying to rescue his friends.', 'Y', 'N', 7.5),
	('Tintin', 'Land Of Black Gold - 1', 2, 10, 'Yes', 'Yes', 'NA', 4, 5, 1992, 'Tintin goes undercover to the Middle East to solve a mysterious oil crisis.', 'Y', 'N', 7.6),
