	('Tintin', 'Flight 714 - 2', 2, 13, 'Yes', 'Yes', 'NA', 25, 5, 1992, 'While trying to rescue a kidnapped millionaire, Tintin receives help from an unlikely source.', 'Y', 'N', 7.7),
	('Tintin', 'The Red Sea Sharks - 1', 3, 1, 'Yes', 'Yes', 'NA', 6, 7, 1992, 'Tintin and Captain Haddock travel to Khemed to rescue the Emir from the danger of arms smugglers who have overthrown his government.', 'Y', 'N', 7.6),
	('Tintin', 'The Red Sea Sharks - 2', 3, 2, 'Yes', 'Yes', 'NA', 13, 7, 1992, 'Tintin and Captain Haddock try to stop a terrible refugee smuggling ring and end up trapped with the other prisoners out at sea.', 'Y', 'N', 7.5),
	('Tintin', 'The Seven Crystal Balls - 1', 3, 3, 'Yes', 'Yes', 'NA', 20, 7, 1992, 'Tintin investigates the mysterious illness that coincidentally falls upon all seven members of a South American expedition.', 'Y', 'N', 8),
	('Tintin', 'The Seven Crystal Balls - 2', 3, 4, 'Yes', 'Yes', 'NA', 27, 7, 1992, 'Tintin and captain Haddock discover that Professor Calculus has been kidnapped.', 'Y', 'N', 8),
	('Tintin', 'Prisoners Of The Sun - 1', 3, 5, 'Yes', 'Yes', 'NA', 3, 8, 1992, 'Tintin and the Captain travel to Peru in search of Professor Calculus.', 'Y', 'N', 8),
