	('Tintin', 'The Castafiore Emerald - 1', 3, 7, 'Yes', 'Yes', 'NA', 17, 8, 1992, 'When Captain Haddock injures himself, he receives a surprise visit from Bianca Castafiore, who is preoccupied about her prized jewels.', 'Y', 'N', 7.5),
	('Tintin', 'The Castafiore Emerald - 2', 3, 8, 'Yes', 'Yes', 'NA', 24, 8, 1992, 'When Bianca Castafiore\'s prized jewel disappears, Tintin secretly investigates the situation.', 'Y', 'N', 7.5),
	('Tintin', 'Destination Moon - 1', 3, 9, 'Yes', 'Yes', 'NA', 31, 8, 1992, 'After receiving a telegram from Professor Calculus, Tintin and Captain Haddock travel to meet him at the atomic centre in Syldavia. They soon discover that the secret rocket ship documents have been stolen.', 'Y', 'N', 7.6),
	('Tintin', 'Destination Moon - 2', 3, 10, 'Yes', 'Yes', 'NA', 7, 9, 1992, 'Tintin and Captain Haddock have been asked to be part of the expedition to the moon. As they help Professor Calculus prepare for the launch, Tintin persists in finding the internal spy.', 'Y', 'N', 7.7),
	('Tintin', 'Explorers On The Moon - 1', 3, 11, 'Yes', 'Yes', 'NA', 14, 9, 1992, 'Tintin, Captain Haddock, Professor Calculus and Wolff blast off to the moon. They soon discover that the Thompsons\' have somehow slipped on board.', 'Y', 'N', 7.8),
	('Tintin', 'Explorers On The Moon - 2', 3, 12, 'Yes', 'Yes', 'NA', 21, 9, 1992, 'Tintin, Captain Haddock, Calculus, the Thompsons\' and Wolff uncover the wonders of the moon. They also discover another person aboard the rocket ship who threatens to leave them all stranded on the moon.', 'Y', 'N', 7.8),
	('Tintin', 'Tintin In America', 3, 13, 'Yes', 'Yes', 'NA', 28, 9, 1992, 'Tintin is covering a story about the gangster in 1930\'s Chicago. And what better way to do that then going there?', 'Y', 'N', 7),
	('Tom And Jerry', 'Puss Gets The Boot', 1, 1, 'Yes', 'Yes', 'NA', 10, 2, 1940, 'Tom chases Jerry all over their house, while Jerry foils Tom\'s plans to catch him. Tom breaks a lot of things in the house, while chasing Jerry, but that\'s when Mammy steps in. Mammy is Tom\'s owner. She tells him that if he breaks one more thing in the house, she\'s going to throw him outside. So, Jerry knocks over a lot of things in the house to make Mammy think Tom did it, and kick him outside. Tom tries his hardest to keep all these things from falling, so he won\'t be thrown outside.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Midnight Snack', 1, 2, 'Yes', 'Yes', 'NA', 19, 7, 1941, 'Jerry decides to have a midnight snack. And what better than to have some nice, fresh cheese! He takes some from the fridge, but before he can eat it, Tom chases him for it. After breaking a lot of things, when chasing Jerry, Mammy hears the noise and comes down in a huff. Scared, Tom throws Jerry into the fridge to hide him. A bit later, Mammy finds Jerry in the fridge. She gets really angry, and throws Tom of out of the house. While Mammy is doing that, Jerry grabs the cheese, and finally eats it.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Night Before Christmas', 1, 3, 'Yes', 'Yes', 'NA', 6, 12, 1941, 'It\'s Christmas Eve. Jerry sees a present wrapped in the shape of cheese.', 'Y', 'N', 0),
	('Tom And Jerry', 'Fraidy Cat', 1, 4, 'Yes', 'Yes', 'NA', 17, 1, 1942, 'On the radio, Tom listens to \'The Witching Hour\' that tells scary stories that almost give Tom a heart attack. After seeing Tom\'s reaction to the radio show, Jerry schemes a way to scare Tom. He moves everything in the house to make it seem like a ghost is in the house. Jerry does everything he can to give Tom a good spook. Tom gets so scared by all the strange things going on that he faints. Later, he finds out that Jerry was the one behind all this, so he chases him around the house. Accidentally, Tom attacks Mammy instead of Jerry, and she, once again, throws him out of the house.', 'Y', 'N', 0),
	('Tom And Jerry', 'Dog Trouble', 1, 5, 'Yes', 'Yes', 'NA', 18, 4, 1942, 'Tom is chasing Jerry again, and they run into a bull dog. The bull dog gets angry, and starts to chase Tom and Jerry.', 'Y', 'N', 0),
	('Tom And Jerry', 'Puss N\' Toots', 1, 6, 'Yes', 'Yes', 'NA', 30, 5, 1942, 'Mammy brings home a cute little kitten who just happens to be a girl. Immediately when Tom sees the kitten, he is smitten. Tom tries to act cool around the kitten, and he gives her presents. Jerry wants to ruin this.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Bowling Alley Cat', 1, 7, 'Yes', 'Yes', 'NA', 18, 7, 1942, 'Tom and Jerry are at the bowling alley. Tom, repeatedly, tries to run over Jerry with his ball. He misses Jerry every time he rolls. Jerry gets back at him by putting the bowling ball on his foot, tying it to his tail, making it hit him when it rolls, etc.', 'Y', 'N', 0),
	('Tom And Jerry', 'Fine Feathered Friend', 1, 8, 'Yes', 'Yes', 'NA', 10, 10, 1942, 'Tom chases Jerry on a farm, and Jerry hides by a hen. The hen is startled by Tom, so she hits him hard. Jerry dresses himself as a chick, and acts like he\'s one of the hen\'s. The rest of the chicks think Jerry is just another one of them. While Tom runs away from the hen, Jerry settles in by the mother and her chicks.', 'Y', 'N', 0),
	('Tom And Jerry', 'Suffering Cats!', 1, 9, 'Yes', 'Yes', 'NA', 16, 1, 1943, 'Jerry is being chased into an alley, and is seen by an alley cat. The alley cat wants to eat him, but Tom steps in, and says that\'s his mouse. The two cats fight each other for Jerry, as he runs away trying to hide. The alley cat says to share the mouse, but Tom wants Jerry all for himself. So, they race to see who will catch Jerry first.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Lonesome Mouse', 1, 10, 'Yes', 'Yes', 'NA', 22, 5, 1943, 'After being framed by Jerry for breaking something, Tom is thrown out of the house by Mammy. Jerry is overjoyed that he has finally won. He sleeps in Tom\'s bed, drinks his milk, and makes himself comfortable in Tom\'s place. After a while, Jerry gets really bored and lonely over the fact that no one is chasing him. There\'s nothing to do. So, Jerry goes outside to find Tom, and Mammy screams for Tom to get the mouse out of the house. Tom chases Jerry all over the house for pretend to satisfy Mammy. Once Tom claims his territory again, Jerry comes back and makes Tom angry. And the chase starts all over again. Jerry is glad to have the excitement back.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Yankee Doodle Mouse', 1, 11, 'Yes', 'Yes', 'NA', 26, 6, 1943, 'Tom is attacking Jerry with everything that\'s in the house. He throws vases, paper airplanes, lamps, and anything he can get his hands on to get Jerry. Basically, it\'s like a war is going on. Jerry retaliates by using a cheese grater, and using fireworks to fight Tom back with. They do the same thing fighting back and forth for the rest of the episode. It ends with Jerry winning the battle, as he blows up Tom using the fireworks, turning him into an American Flag.', 'Y', 'N', 0),
	('Tom And Jerry', 'Baby Puss', 1, 12, 'Yes', 'Yes', 'NA', 25, 12, 1943, 'A little girl is dollying up Tom to make him look like a baby cat. Jerry laughs at him, prompting Tom to chase him around the house into a dollhouse. Jerry dresses up like a doll to escape from Tom, without him noticing. Jerry shows the alley cats from outside the way Tom looks, and they laugh and make fun of him. The alley cats come in the house, and dress Tom in diapers and REALLY make him look like a baby. That\'s when the little girl appears, and makes the alley cats leave in a hurry. The little girl continues to turn Tom into a baby cat, while Jerry and the alley cats watch while laughing at him.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Zoot Cat', 1, 13, 'Yes', 'Yes', 'NA', 26, 2, 1944, 'Tom gives Jerry, as a present to a girl cat he really likes. The girl doesn\'t accept the gift, and Tom goes back to the house with a pout. He hears on the radio about a zoot suit. Tom cuts out and sews together a very tight and nice-looking suit. He goes back to the girl cat\'s house, and as soon as she sees Tom\'s new suave look, she swoons. Tom acts like Charles Boyer, and he makes the girl fall in love with him. Jerry sees he has to ruin this. He does something to anger Tom, which makes him chase Jerry around the house, and tripped into a fishbowl. The suit shrinks to Jerry\'s size, and Jerry wears it. He takes Tom\'s place, and acts like a mini Charles Boyer to the girl cat.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Million Dollar Cat', 1, 14, 'Yes', 'Yes', 'NA', 6, 5, 1944, 'The usual chase is going on between Tom and Jerry, until a letter arrives. Tom reads it and finds out that he inherited one million dollars by one of his uncles! He cheers in happiness, until Jerry reads it, and points out one detail that Tom missed. Tom can\'t harm any living thing - not even a mouse! Jerry rejoices the inheritance because since Tom is not allowed to hurt any living thing, it means he can get away with doing anything he wants without Tom fighting back. Jerry proceeds to torture Tom by taking advantage of his new life, sleeping in his bed and eating all of his food. Finally, after Tom loses his breakfast and gets a pad of butter in the eye, he loses it and begins to beat up Jerry. He then says, \'Gee, I\'m throwing away a million dollars... BUT I\'M HAPPY!!\'', 'Y', 'N', 0),
	('Tom And Jerry', 'The Bodyguard', 1, 15, 'Yes', 'Yes', 'NA', 22, 7, 1944, 'In a heroic effort, Jerry rescues Spike from the dogcatcher. Spike thanks him by telling him to whistle whenever he needs help if Tom chases him.', 'Y', 'N', 0),
	('Tom And Jerry', 'Putting On The Dog', 1, 16, 'Yes', 'Yes', 'NA', 28, 10, 1944, 'Tom chases Jerry right into a dog pound. Jerry makes himself comfortable once there, knowing that Tom will never follow him in. Tom thinks of something, though. He puts on a dog mask, and acts like a dog, going into the pound. After chasing Jerry for a while, he tells all the dogs that Tom\'s really a cat under the mask. All of the dogs chase Tom out of the pound.', 'Y', 'N', 0),
	('Tom And Jerry', 'Mouse Trouble', 1, 17, 'Yes', 'Yes', 'NA', 23, 11, 1944, 'Tom starts to read a book called \'How to catch a Mouse\'. Although, the traps are set for Jerry... the clever mouse thwarts Tom\'s plan to catch him, and Tom goes through all the traps in a brutal way.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Mouse Comes To Dinner', 1, 18, 'Yes', 'Yes', 'NA', 5, 5, 1945, 'Tom hits Jerry with a hammer, and is used as a servant for his new girlfriend. Tom dresses Jerry up as a waiter, and makes him do whatever he says. Jerry starts to fight with Tom, and Tom does the same. His girlfriend is turned off by all this. So she leaves, as the cat and mouse go back to the usual fighting.', 'Y', 'N', 0),
	('Tom And Jerry', 'Mouse In Manhattan', 1, 19, 'Yes', 'Yes', 'NA', 7, 7, 1945, 'Jerry decides to move out of the country, and into the big city. He writes a note for Tom, telling him about his departure. He arrives in the city to have bad luck everywhere. He is chased by traffic, chased by cats, hit with different things, and is shot at by the police. Jerry knows that the city is just not for him. He goes back to the country, and tears the note he wrote for Tom to shreds. It\'s good to be home.', 'Y', 'N', 0),
	('Tom And Jerry', 'Tee For Two', 1, 20, 'Yes', 'Yes', 'NA', 21, 7, 1945, 'Tom and Jerry are at a golf course. Tom uses Jerry as a tee. After playing atrociously, and getting hit with a ton of golf balls, he is attacked by everything on and off the course. Jerry, of course, does whatever he can to get back at Tom for using him as a tee.', 'Y', 'N', 0),
	('Tom And Jerry', 'Flirty Birdy', 1, 21, 'Yes', 'Yes', 'NA', 22, 9, 1945, 'Tom has Jerry caught. He is just ready to eat him, when an eagle comes in, and takes Jerry away.', 'Y', 'N', 0),
	('Tom And Jerry', 'Quiet Please!', 1, 22, 'Yes', 'Yes', 'NA', 22, 12, 1945, 'After Tom chases Jerry around the house, and makes a ton of noise, a grumpy Spike tells Tom that if he hears one more thing, he will do his worst.', 'Y', 'N', 0),
	('Tom And Jerry', 'Springtime For Thomas', 1, 23, 'Yes', 'Yes', 'NA', 30, 3, 1946, 'Tom is in love with his new girlfriend, a white cat. He makes her feel special, as he gives her little kisses, etc. Mischievous little Jerry thinks of something to break up the new couple. He writes a fake letter to an alley cat, telling him that the white cat has fallen in love with him. Once the alley cat sees Tom with her, trouble stirs.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Milky Waif', 1, 24, 'Yes', 'Yes', 'NA', 18, 5, 1946, 'A lost baby mouse is found by Jerry. His name is Nibbles. He\'s always hungry, and eating anything he can get his teeth into. Jerry takes care of the baby, while he does his best to keep him far away from Tom. But Nibbles\' hunger gets the better of him, when he proceeds to drink Tom\'s milk. Tom chases Nibbles around the house, as Jerry tries to save him, repeatedly.', 'Y', 'N', 0),
	('Tom And Jerry', 'Trap Happy', 1, 25, 'Yes', 'Yes', 'NA', 29, 6, 1946, 'When Tom loses his patience with chasing Jerry constantly, he hires a mouse exterminator to get rid of Jerry once and for all. Once Butch arrives, everything goes according to plan... but not for long. Jerry quickly gains the upper hand, backfiring all capture attempts upon both Tom and Butch.', 'Y', 'N', 0),
	('Tom And Jerry', 'Solid Serenade', 1, 26, 'Yes', 'Yes', 'NA', 31, 8, 1946, 'It\'s a moonlit night, and Tom wants to impress a cute female kitten. So he brings a guitar, ties up Spike, the one guarding Toodles\' property, and plays a serenade for Toodles. Unfortunately for Jerry, who happens to dwell close by, the serenading disturbs his sleep. More annoyed than ever, he decides to do all he can to ruin Tom\'s night.', 'Y', 'N', 0),
	('Tom And Jerry', 'Cat Fishing', 1, 27, 'Yes', 'Yes', 'NA', 22, 2, 1947, 'It\'s beautiful day at a lake... one that\'s surrounded by a fence that\'s plastered all over with \'keep out\' and \'no fishing\' signs. Not to mention the bulldog who guards it. But that doesn\'t stop Tom, as he takes a chance by sneaking in to go fishing anyway, using Jerry as live bait...', 'Y', 'N', 0),
	('Tom And Jerry', 'Part Time Pal', 2, 1, 'Yes', 'Yes', 'NA', 15, 3, 1947, 'Tom is told by his owner, Mammy Two-Shoes, to guard the refrigerator for the night and keep Jerry away from it, or else he\'ll be thrown out of the house. Upon hearing this, Jerry outwits Tom, but goes too far... to a point where Tom falls into a barrel of cider and gets drunk. The drunk Tom is nice to Jerry, but makes a mess in the kitchen, among other things that are against Mammy\'s orders. So Jerry does his best to snap Tom out of it before the cat gets into some serious trouble with Mammy.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Cat Concerto', 2, 2, 'Yes', 'Yes', 'NA', 26, 4, 1947, 'In this episode, Tom plays as a concert pianist who plays beautifully, but keeps getting interrupted when Jerry is inside of the piano, making Tom hit the wrong keys. Throughout the episode, Tom tries to squash Jerry by hitting the keys he\'s on.', 'Y', 'N', 0),
	('Tom And Jerry', 'Dr. Jekyll And Mr. Mouse', 2, 3, 'Yes', 'Yes', 'NA', 14, 6, 1947, 'Jerry drinks a potion that makes him grow super-strong. He decides to go after Tom because this time, he\'s stronger. Once the potion wears off, Tom drinks some of it himself and grows bigger and super-strong. But he then immediately shrinks to half the size of Jerry, then to the size of an ant, and runs away from Jerry, who proceeds to chase him with a fly-swatter.', 'Y', 'N', 0),
	('Tom And Jerry', 'Salt Water Tabby', 2, 4, 'Yes', 'Yes', 'NA', 12, 7, 1947, 'While Tom woos a female cat at the beach, Jerry tries to disrupt his fun by playing pranks on him.', 'Y', 'N', 0),
	('Tom And Jerry', 'A Mouse In The House', 2, 5, 'Yes', 'Yes', 'NA', 30, 8, 1947, 'Mammy Two-Shoes is sick and tired of Jerry, period. So she enlists both Tom and Butch to catch him, saying that whichever cat is successful in the capture gets to stay in the house, and whoever fails gets kicked out along with Jerry.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Invisible Mouse', 2, 6, 'Yes', 'Yes', 'NA', 27, 9, 1947, 'Tom is chasing Jerry as usual, when Jerry dives into a bottle of ink to hide. Not noticing, Tom dashes off in which he thinks is the direction the mouse went. When Jerry emerges from the bottle, he finds the bottom half of his body invisible! He then realized that the ink he was in is invisible ink, so he covers his whole body in it and goes after Tom, planning on giving him a good scare.', 'Y', 'N', 0),
	('Tom And Jerry', 'Kitty Foiled', 2, 7, 'Yes', 'Yes', 'NA', 1, 6, 1948, 'Tom has finally caught Jerry and is about to eat him. But the house canary can\'t bare that and comes to Jerry\'s rescue. With that, Tom goes after the both of them, but the teamwork between Jerry and the canary outdoes Tom completely.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Truce Hurts', 2, 8, 'Yes', 'Yes', 'NA', 17, 7, 1948, 'Tired of fighting, Tom, Jerry, and Spike sign a truce. Now, they protect each other, sleep next to one another, and so on. Until a big steak gets dropped by their house, that\'s when they start to fight over who gets the bigger share.', 'Y', 'N', 0),
	('Tom And Jerry', 'Old Rocking Chair Tom', 2, 9, 'Yes', 'Yes', 'NA', 18, 9, 1948, 'Mammy Two-Shoes is being \'attacked\' by Jerry again, so she once more orders Tom to get rid of him. When he epically fails once again, Mammy decides that Tom is too old to work in the mouse-catching business anymore, and brings in a younger, faster, and more hyper cat named Lightning that disposes of Jerry in an instant. Proud of the new cat, Mammy tells him to take good care of Tom, and goes to bed. But when Lightning frames Tom for raiding the refrigerator, Tom gets kicked out of the house, as well. So both Tom and Jerry come up with a plan to get rid of Lightning once and for all.', 'Y', 'N', 0),
	('Tom And Jerry', 'Professor Tom', 2, 10, 'Yes', 'Yes', 'NA', 30, 10, 1948, 'Tom is doing his best to teach a younger cat how to catch a mouse, but the youngster isn\'t able to focus very well. When Tom finally tells the young cat to do a test run by catching Jerry, the little one determinedly sets off. But Jerry sees that the young cat likes mice despite his teachings, and takes advantage of this and uses it against Tom.', 'Y', 'N', 0),
	('Tom And Jerry', 'Mouse Cleaning', 2, 11, 'Yes', 'Yes', 'NA', 11, 12, 1948, 'As soon as Mammy finishes cleaning the house, in come Tom and Jerry to mess it all up. She cleans up the house again, but tells Tom that if he creates another mess, when she comes back from the store, he\'s going to have to leave. Jerry sees his chance to get Tom out of the house..', 'Y', 'N', 0),
	('Tom And Jerry', 'Polka-Dot Puss', 2, 12, 'Yes', 'Yes', 'NA', 26, 2, 1949, 'Mammy Two-Shoes is about to put Tom out for the night, but since there\'s a lightning storm going on, Tom fakes being sick in order to stay in. Mammy falls for it, and allows Tom to sleep indoors. Tom is delighted that his trick worked, but Jerry is annoyed at this, so he paints red dots all over Tom\'s face to make him actually look sick. Tom falls for this, so he succumbs to letting Jerry take care of him... in quite a brutal way.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Little Orphan', 2, 13, 'Yes', 'Yes', 'NA', 30, 4, 1949, 'An orphan mouse comes and joins Tom and Jerry for Thanksgiving Dinner. Nibbles is always hungry, so he eats everything in sight. An angry Tom chases him around the house, while Jerry tries to help Nibbles hide.', 'Y', 'N', 0),
	('Tom And Jerry', 'Hatch Up Your Troubles', 2, 14, 'Yes', 'Yes', 'NA', 14, 5, 1949, 'A woodpecker egg falls from its nest, and rolls to Jerry\'s door. It hatches, and Jerry puts it back in its nest. The woodpecker follows Jerry back to his hole, and that\'s when it goes over by Tom..', 'Y', 'N', 0),
	('Tom And Jerry', 'Heavenly Puss', 2, 15, 'Yes', 'Yes', 'NA', 9, 7, 1949, 'Tom gets killed by a piano, and starts to float up to Heaven. But he doesn\'t get to go in, because he\'s been trying to get Jerry all these years. The only way for him to get into Heaven is to have Jerry sign a piece of paper, stating as an apology. If Jerry doesn\'t sign it.. then Tom\'s going down under.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Cat And The Mermouse', 2, 16, 'Yes', 'Yes', 'NA', 3, 9, 1949, 'Tom drowns in a lake, and goes to the bottom. There, he finds a mermouse, and then tries to capture it and eat it. The mermouse doesn\'t give in so easily, though.', 'Y', 'N', 0),
	('Tom And Jerry', 'Love That Pup', 2, 17, 'Yes', 'Yes', 'NA', 1, 10, 1949, 'Mistakenly grabbing Spike\'s son, instead of Jerry, Spike lets Tom have it. Jerry makes himself comfortable over by Spike, while Tom tries to devise a plan to get Jerry without having either of the dogs notice.', 'Y', 'N', 0),
	('Tom And Jerry', 'Jerry\'s Diary', 2, 18, 'Yes', 'Yes', 'NA', 22, 10, 1949, 'After getting tired of chasing Jerry, Tom sits down and finds Jerry\'s Diary. He opens it and starts to read it, showing clips of past episodes.', 'Y', 'N', 0),
	('Tom And Jerry', 'Tennis Chumps', 2, 19, 'Yes', 'Yes', 'NA', 10, 12, 1949, 'Tom competes against Butch in a tennis tournament. Bad luck keeps happening throughout the game, though. Jerry sees and figures he can use this to his advantage. He uses tricks though, as he competes against both Tom and Butch.', 'Y', 'N', 0),
	('Tom And Jerry', 'Little Quacker', 2, 20, 'Yes', 'Yes', 'NA', 7, 1, 1950, 'Tom finds a duck egg, and decides to have it for breakfast. The egg hatches as Tom prepares to cook it. As soon as Jerry sees this, he swipes the duck away from Tom just in time. Tom starts to chase Jerry for the duck, while they foil Tom\'s plans to have duck soup.', 'Y', 'N', 0),
	('Tom And Jerry', 'Saturday Evening Puss', 2, 21, 'Yes', 'Yes', 'NA', 14, 1, 1950, 'Mammy wants to go out to dinner. So, Tom invites his friends over a party, and they use Jerry as a needle on a record player. After Jerry escapes from this, he gets back at Tom and his friends, by giving them some of their own medicine.', 'Y', 'N', 0),
	('Tom And Jerry', 'Texas Tom', 2, 22, 'Yes', 'Yes', 'NA', 11, 3, 1950, 'In this episode, Tom is a cowboy, and he uses Jerry like a lackey. He does all sorts of things to impress a female cat. Jerry gets mad, and releases a big bull on Tom that Tom runs away from in a hurry, and makes the female cat un-impressed.', 'Y', 'N', 0),
	('Tom And Jerry', 'Jerry And The Lion', 2, 23, 'Yes', 'Yes', 'NA', 8, 4, 1950, 'On the radio, Tom and Jerry hear that a lion is loose in their area. Frightened, Tom gets on his hunting outfit and gets out a rifle. A bit later, Jerry finds the lion in their house, and learns that the lion\'s harmless, but he asks the lion to play a trick on Tom to make him look like he\'s ferocious.', 'Y', 'N', 0),
	('Tom And Jerry', 'Safety Second', 2, 24, 'Yes', 'Yes', 'NA', 1, 7, 1950, 'It\'s the 4th of July, and Nibbles is looking forward to an exciting day with lots of fireworks. But Jerry is against this, considering safety first. Nibbles still sneaks out the fireworks anyway, which eventually leads to an explosive battle against Tom.', 'Y', 'N', 0),
	('Tom And Jerry', 'Tom And Jerry In The Hollywood Bowl', 2, 25, 'Yes', 'Yes', 'NA', 16, 9, 1950, 'At the Hollywood Bowl, Tom is the conductor. Jerry wants to help out, and he gets in Tom\'s sleeves to help conduct. Tom denies his assistance again and again. Jerry gets mad and starts hitting Tom with instruments, and Tom does the same.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Framed Cat', 2, 26, 'Yes', 'Yes', 'NA', 21, 10, 1950, 'Jerry gets blamed for stealing a piece of chicken, and Mammy makes Tom chase him. Mad, Jerry goes and frames Tom by saying that he stole Spike\'s bone, which leaves to even more frame-ups..', 'Y', 'N', 0),
	('Tom And Jerry', 'Cue Ball Cat', 2, 27, 'Yes', 'Yes', 'NA', 25, 11, 1950, 'The setting is of a poolroom. Tom uses Jerry as a ball, as he hits with his cue stick, trying to get into each of the pockets, and so on. Jerry does the same to get back at him.', 'Y', 'N', 0),
	('Tom And Jerry', 'Casanova Cat', 3, 1, 'Yes', 'Yes', 'NA', 6, 1, 1951, 'Tom is using Jerry for many embarrassing things to, once again, impress a female cat. Jerry gets frustrated and calls Butch to get the female cat. Tom and Butch duke it out to see who will get to have her.', 'Y', 'N', 0),
	('Tom And Jerry', 'Jerry And The Goldfish', 3, 2, 'Yes', 'Yes', 'NA', 3, 3, 1951, 'Jerry and the house\'s goldfish, Goldy, become best friends. Tom hears a recipe on the radio for fish, and he instantly grabs Goldy to cook him. Jerry saves him, and Tom chases both of them around the house..', 'Y', 'N', 0),
	('Tom And Jerry', 'Jerry\'s Cousin', 3, 3, 'Yes', 'Yes', 'NA', 7, 4, 1951, 'There are beaten up alley cats in the street. This is the work of Muscles Mouse, Jerry\'s cousin. He calls up Jerry, and tells him that he wants to help take care of Tom for him.', 'Y', 'N', 0),
	('Tom And Jerry', 'Sleepy-Time Tom', 3, 4, 'Yes', 'Yes', 'NA', 26, 5, 1951, 'Tom and his friends come back from partying all night early in the morning at the crack of dawn. Mammy caught Tom sleeping on the window, and she\'s mad at Tom, because she had to keep Jerry away from the food. Tom is very tired and can do nothing but sleep, but Mammy says if she catches Tom sleeping on the job, he will be thrown out. Jerry overhears this, and tries to make Tom fall asleep every time.', 'Y', 'N', 0),
	('Tom And Jerry', 'His Mouse Friday', 3, 5, 'Yes', 'Yes', 'NA', 7, 7, 1951, 'Lost at sea on a life raft, Tom washes ashore on a deserted island. He meets up with Jerry, posing as a cannibal.', 'Y', 'N', 0),
	('Tom And Jerry', 'Slicked-up Pup', 3, 6, 'Yes', 'Yes', 'NA', 8, 9, 1951, 'Spike is giving his son, Tyke, a bath. Once finished, he leaves him on the porch to go get some meat. But he doesn\'t go too far before Tom and Jerry\'s chasing antics cause Tyke to fall into the mud and get dirty again. After ordering Tom to clean him up, Spike warns him that if he\'s dirty again by the time he gets back, he\'ll pound him to pieces. Upon hearing this, Jerry attempts to get Tyke dirty himself in order to get Tom into trouble.', 'Y', 'N', 0),
	('Tom And Jerry', 'Nit-Witty Kitty', 3, 7, 'Yes', 'Yes', 'NA', 6, 10, 1951, 'Tom is chasing Jerry as usual, with Mammy Two-Shoes cheering him on. But when she attempts to crush Jerry herself by whacking him with a broom, she accidentally whacks Tom on the head instead. This causes Tom to suffer a case of amnesia, and he begins to act like a mouse. So both Jerry and Mammy individually try to cure him.', 'Y', 'N', 0),
	('Tom And Jerry', 'Cat Napping', 3, 8, 'Yes', 'Yes', 'NA', 8, 12, 1951, 'It\'s a sunny day, and Tom walks out into the backyard with some lemonade and a pillow, ready to relax to his heart\'s content on a hammock. But when he finds out that Jerry is already sleeping there, he tosses him off. A fight then ensures for who gets the hammock.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Flying Cat', 3, 9, 'Yes', 'Yes', 'NA', 12, 1, 1952, 'Tom is chasing both Jerry and the house canary, but the two go out of reach by taking refuge in the canary\'s birdhouse. Tom tries everything to get up to them, but everything fails, ultimately resulting in him crashing through the whole house. When he comes out the other side, he has pink lace attached to him. Tom realizes that he can actually use the lace as wings to fly; a new weapon in his quest to get to Jerry and the canary...', 'Y', 'N', 0),
	('Tom And Jerry', 'The Duck Doctor', 3, 10, 'Yes', 'Yes', 'NA', 16, 2, 1952, 'It\'s the time of year for ducks to be migrating, and little Quacker is among them. Unfortunately, Tom is out hunting ducks, and manages to shoot Quacker\'s wing, causing him to fall. Delighted, Tom goes after him, but Jerry saves him, doing his best to heal Quacker\'s wound and keep him safe from Tom at the same time.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Two Mouseketeers', 3, 11, 'Yes', 'Yes', 'NA', 15, 3, 1952, 'Given the responsibilities, by the tyrannical King, of guarding the grand banquet table, Tom is confronted by the sudden appearance of Jerry and Tuffy, the Mouseketeers.', 'Y', 'N', 0),
	('Tom And Jerry', 'Smitten Kitten', 3, 12, 'Yes', 'Yes', 'NA', 12, 4, 1952, 'Jerry gets annoyed when he sees Tom fall for a female cat once again. With the help of his evil self, he remembers all of Tom\'s past relationships and all of the trouble that they caused him.', 'Y', 'N', 0),
	('Tom And Jerry', 'Triplet Trouble', 3, 13, 'Yes', 'Yes', 'NA', 19, 4, 1952, 'Mammy receives 3 kittens to take care of. Tom gets to take care of them, but what Mammy doesn\'t know is that the three cats are evil. Tom knows they\'re evil, but Mammy thinks they are \'little angels\'. She goes out to buy cream for them. This gives them the chance to torture Tom. Later, they see Jerry and decides to torture him too. Tom & Jerry then decide to work together and get back on the cats.', 'Y', 'N', 0),
	('Tom And Jerry', 'Little Runaway', 3, 14, 'Yes', 'Yes', 'NA', 14, 6, 1952, 'When a baby seal escapes from the circus, it\'s befriended by Jerry. Tom hears that there\'s a big reward for the return of the seal, so he tries to catch it, with Jerry doing his best to protect it.', 'Y', 'N', 0),
	('Tom And Jerry', 'Fit To Be Tied', 3, 15, 'Yes', 'Yes', 'NA', 26, 7, 1952, 'Spike steps on a tack while walking and is really hurt. Jerry hears him, and helps take out the tack. To thank him, Spike gives Jerry a bell to ring whenever he\'s in trouble.', 'Y', 'N', 0),
	('Tom And Jerry', 'Push-Button Kitty', 3, 16, 'Yes', 'Yes', 'NA', 6, 9, 1952, 'Mammy is tired of Tom being lazy and just lying around doing nothing. She receives a package that she\'s been wanting. It\'s a robot-cat. Tom first thinks it\'s just a robot, but when he sees how the cat got rid of Jerry, he feels sad and leaves. Every time Jerry tries to get back in the house, the robot throws him out. Jerry has a plan to keep the robot busy. He puts three wind-up mice in the house. The robot causes all kinds of destruction while trying to catch the mice. Mammy sees what a mess he made, and she begs Tom to come back.', 'Y', 'N', 0),
	('Tom And Jerry', 'Cruise Cat', 3, 17, 'Yes', 'Yes', 'NA', 18, 10, 1952, 'A luxury cruise ship is bound for Honolulu, Hawaii, and Tom is the ship\'s mascot. The captain tells Tom that if he sees one mouse on the ship, he\'ll be kicked off and replaced with a new mascot. Of course, Jerry, who\'s on vacation, then discovers the ship and decides to climb aboard.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Dog House', 3, 18, 'Yes', 'Yes', 'NA', 29, 11, 1952, 'Spike is building a dog house of his very own. Though unfortunately for him, Tom and Jerry\'s chasing antics keep destroying his efforts over and over again...', 'Y', 'N', 0),
	('Tom And Jerry', 'The Missing Mouse', 3, 19, 'Yes', 'Yes', 'NA', 10, 1, 1953, 'The radio reports that a white mouse, having swallowed enough explosives to blow up the city, has escaped from a lab.', 'Y', 'N', 0),
	('Tom And Jerry', 'Jerry And Jumbo', 3, 20, 'Yes', 'Yes', 'NA', 21, 2, 1953, 'It\'s nighttime, and a circus train is passing through town. But a baby elephant is sleeping too close to the edge of the car he\'s in, and tumbles out, rolls down the hill, into a house, and right into Tom\'s basket. Not noticing out of tiredness, Tom curls up on top of the elephant, who\'s under the blanket. It manages to make a quick getaway, then sucks up Tom\'s milk with it\'s truck. Thinking it was Jerry, Tom marches into the kitchen. Jerry was actually drinking milk, but is wasn\'t Tom\'s. Still thinking he did it, Tom prepares to smash his bowl on him, when the elephant comes to his rescue. The two then hide from Tom in the closet, and decide to play a trick on him; Jerry paints the elephant to make him look like a super-sized version of himself...', 'Y', 'N', 0),
	('Tom And Jerry', 'Johann Mouse', 3, 21, 'Yes', 'Yes', 'NA', 21, 3, 1953, 'The narrator tells the story of a waltzing mouse named Johann who lives in Vienna in Johann Strauss\' home. Tom tries to catch Jerry each time he\'s dancing to Johann Strauss\' piano music, but when a day arrives in which Johann Strauss is absent, Tom decides to learn how to play the piano in order to raise his chances of catching Jerry...', 'Y', 'N', 0),
	('Tom And Jerry', 'That\'s My Pup!', 3, 22, 'Yes', 'Yes', 'NA', 25, 4, 1953, 'Spike is teaching his son Tyke the facts of life about being a dog. One lesson is chasing cats and Tom happens to be the object lesson of the day.', 'Y', 'N', 0),
	('Tom And Jerry', 'Just Ducky', 3, 23, 'Yes', 'Yes', 'NA', 5, 9, 1953, 'Six eggs of a mother duck have just hatched. Delighted, the mother duck goes swimming, with five of her ducklings close behind. But unfortunately, the last duckling can\'t swim, and becomes sad.', 'Y', 'N', 0),
	('Tom And Jerry', 'Two Little Indians', 3, 24, 'Yes', 'Yes', 'NA', 17, 10, 1953, 'Scoutmaster Jerry has his hands full with two little orphans from the Bide a Wee Mouse Home. Outfitted in Indian feathers and diapers , the two involve Jerry and the sleeping Spike in a hair-raising battle with Tom.', 'Y', 'N', 0),
	('Tom And Jerry', 'Life With Tom', 3, 25, 'Yes', 'Yes', 'NA', 21, 11, 1953, 'The third flashback toon. This one has Tom reading Jerry\'s best selling book, \'Life with Tom\'.', 'Y', 'N', 0),
	('Tom And Jerry', 'Puppy Tale', 3, 26, 'Yes', 'Yes', 'NA', 23, 1, 1954, 'Jerry resues a sackful of puppies from a storm swollen river and on of the pups follows Jerry home. Tom, being the cat that he is, doesn\'t want a dog around.', 'Y', 'N', 0),
	('Tom And Jerry', 'Posse Cat', 3, 27, 'Yes', 'Yes', 'NA', 30, 1, 1954, 'The ranch cook tells Tom that he won\'t be getting any more food unless he gets rid of Jerry.', 'Y', 'N', 0),
	('Tom And Jerry', 'Hic-cup Pup', 4, 1, 'Yes', 'Yes', 'NA', 17, 4, 1954, 'Tom accidentally gives Tyke the hiccups when he, also accidentally, awakens him from his nap. Spike is not pleased about this, and won\'t stop standing over Tom until he gets rid of Tyke\'s hiccups.', 'Y', 'N', 0),
	('Tom And Jerry', 'Little School Mouse', 4, 2, 'Yes', 'Yes', 'NA', 29, 5, 1954, 'After being chased by Tom once again, Professor Jerry escapes into his classroom i.e. mouse hole. Once there, he proceeds to teach his only student, Nibbles, how to outwit a cat. And the subject for the lesson is none other than Tom.', 'Y', 'N', 0),
	('Tom And Jerry', 'Baby Butch', 4, 3, 'Yes', 'Yes', 'NA', 14, 8, 1954, 'Butch is going shopping... in an ally. He finds what he can in a garbage cans, and takes them with him. But a bottle of fresh milk on a doorstep catches his attention, and goes over to get it. But Tom opens the door and takes the milk before Butch can. Butch then sees a cooked chicken on the windowsill, and proceeds to takes that, only to have the window slammed shut on his fingers before he can. Determined, Butch dresses up as a hungry baby in order to get into the house and snatch the chicken, as well as all of the other delicious foods that could be there...', 'Y', 'N', 0),
	('Tom And Jerry', 'Mice Follies', 4, 4, 'Yes', 'Yes', 'NA', 4, 9, 1954, 'It\'s icy fun in the kitchen, as Jerry and Nibbles turn the floor into an ice-skating rink by freezing overflowing faucets.', 'Y', 'N', 0),
	('Tom And Jerry', 'Neapolitan Mouse', 4, 5, 'Yes', 'Yes', 'NA', 2, 10, 1954, 'While touring Naples, Italy, Tom and Jerry are befriended by an Italian mouse named Topo, a champion of justice who helps his new friends fight off some tough Italian dogs.', 'Y', 'N', 0),
	('Tom And Jerry', 'Downhearted Duckling', 4, 6, 'Yes', 'Yes', 'NA', 13, 11, 1954, 'The little duckling is sad, because he just read \'the ugly duckling\'. He cries because the duck looks just like him. Jerry hears him crying and tries to make him feel better. But no matter what, the duck thinks he looks ugly.', 'Y', 'N', 0),
	('Tom And Jerry', 'Pet Peeve', 4, 7, 'Yes', 'Yes', 'NA', 20, 11, 1954, 'Husband and wife tell Tom and Spike that, due to the high cost of feeding them, one must go, and the one who catches Jerry will stay.', 'Y', 'N', 0),
	('Tom And Jerry', 'Touche, Pussy Cat!', 4, 8, 'Yes', 'Yes', 'NA', 18, 12, 1954, 'Tuffy\'s father sends him to Jerry for Mouseketeer training. He fails miserable and destroys Jerry\'s place in the process. However, he gains the Mouseketeer title when he thwarts Tom.', 'Y', 'N', 0),
	('Tom And Jerry', 'Southbound Duckling', 4, 9, 'Yes', 'Yes', 'NA', 12, 3, 1955, 'Stubborn Quacker, convinced this time that all ducks go south for the winter, refuses to stay home like his domestic buddies even though he can\'t fly. To complicate things Tom is hungry for a duck meal.', 'Y', 'N', 0),
	('Tom And Jerry', 'Pup On A Picnic', 4, 10, 'Yes', 'Yes', 'NA', 30, 4, 1955, 'Spike and his son, Tyke, are on a picnic, but happen do have one in the same place in which Tom and Jerry\'s chasing antics are going on, and the two groups collide. It\'s then an array of food fight fun as Tom, Jerry, Spike, and Tyke, as well as an army of ants, vie for control of the picnic basket.', 'Y', 'N', 0),
	('Tom And Jerry', 'Mouse For Sale', 4, 11, 'Yes', 'Yes', 'NA', 21, 5, 1955, 'With white mice being the new rage, Tom paints Jerry white and sells him for a bucketful of money, which he hides under the carpet back home.', 'Y', 'N', 0),
	('Tom And Jerry', 'Designs On Jerry', 4, 12, 'Yes', 'Yes', 'NA', 2, 9, 1955, 'Knowing that he can make a lot of money this way, Tom designs the ultimate mouse trap. But after he goes to sleep, the mouse in his blueprints comes to life and warns Jerry about the upcoming threat that this mouse trap puts upon him...', 'Y', 'N', 0),
	('Tom And Jerry', 'Tom And Cherie', 4, 13, 'Yes', 'Yes', 'NA', 9, 9, 1955, 'Hopelessly in love with a female mouse named Lilli, Jerry uses Nibbles as an errand boy to send letters back and forth between them. Unfortunately for Nibbles, he has to deal with Tom during these back-and-forth trips.', 'Y', 'N', 0),
	('Tom And Jerry', 'Smarty Cat', 4, 14, 'Yes', 'Yes', 'NA', 14, 10, 1955, 'Tom and his alley cat palls are going through home movies, and Jerry wants to watch them, too. But Tom and his buddies don\'t want him around and toss him out the window. Annoyed, Jerry decides to get back at them by waking up Spike and angering him by showing him how he\'s depicted as a big goof in those movies.', 'Y', 'N', 0),
	('Tom And Jerry', 'Pecos Pest', 4, 15, 'Yes', 'Yes', 'NA', 11, 11, 1955, 'Jerry gets a telegram from his Uncle Pecos that says that he\'s going to spend the night with him before his big debut on TV. Arriving quickly, he gives Jerry a demonstration of his guitar skills. But when one of his guitar\'s strings snap, he fearlessly walks up to Tom and pulls one of his whiskers to replace it. Annoyed at first, Tom soon becomes afraid of Uncle Pecos, whose guitar strings are always snapping, and it\'s always Tom\'s whiskers that he targets to replace them.', 'Y', 'N', 0),
	('Tom And Jerry', 'That\'s My Mommy', 4, 16, 'Yes', 'Yes', 'NA', 19, 11, 1955, 'A duck egg rolls out of its nest and on Tom. When the egg cracks, it sees Tom, and it thinks Tom is his mother.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Flying Sorceress', 4, 17, 'Yes', 'Yes', 'NA', 27, 1, 1956, 'When Tom is scolded by his owner for always breaking things while chasing Jerry, he decides to get a job. He soon finds one that sounds good to him, but it turns out to be the job of a witch\'s cat. After a scary ride on the witch\'s broom, Tom gets the job and the witch goes to bed. Tom then decides to take the broom himself, and ride it back home to give Jerry a good scare.', 'Y', 'N', 0),
	('Tom And Jerry', 'The Egg And Jerry', 4, 18, 'Yes', 'Yes', 'NA', 23, 3, 1956, 'A CinemaScope remake of the 1949 episode, Hatch Up Your Troubles.', 'Y', 'N', 0),
	('Tom And Jerry', 'Busy Buddies', 4, 19, 'Yes', 'Yes', 'NA', 4, 5, 1956, 'A prequel to the upcoming Tot Watchers. This concerns Jeannie, the babysitter whose primary interest is talking on the phone.', 'Y', 'N', 0),
	('Tom And Jerry', 'Muscle Beach Tom', 4, 20, 'Yes', 'Yes', 'NA', 7, 9, 1956, 'Tom and Butch both try to impress a female cat with their muscle building abilities, with not only each other, but Jerry, for competition.', 'Y', 'N', 0),
	('Tom And Jerry', 'Down Beat Bear', 4, 21, 'Yes', 'Yes', 'NA', 21, 10, 1956, 'Tom and Jerry hear on the radio about a bear that escaped from the circus who always dances whenever music is playing. When the bear finds it\'s way to their house, and music starts playing, it takes Tom as it\'s reluctant dancing partner. Amused by this, Jerry does his best to keep the music going so he can continue to watch Tom get helplessly thrown around by the dancing bear.', 'Y', 'N', 0),
	('Tom And Jerry', 'Blue Cat Blues', 4, 22, 'Yes', 'Yes', 'NA', 6, 11, 1956, 'Tom is sitting on the railroad tracks, feeling miserable about losing his girlfriend to his rival Butch again. Feeling sad for him, Jerry narrates the whole story as he watches on.', 'Y', 'N', 0),
	('Tom And Jerry', 'Barbecue Brawl', 4, 23, 'Yes', 'Yes', 'NA', 14, 12, 1956, 'Spike\'s perfect pool-side barbecue with Tyke turns into a disaster when Tom and Jerry come crashing through with their usual chasing antics.', 'Y', 'N', 0),
	('Tom And Jerry', 'Tops With Pops', 4, 24, 'Yes', 'Yes', 'NA', 22, 2, 1957, 'This is a CinemaScope remake of the 1949 episode, Love That Pup.', 'Y', 'N', 0),
	('Tom And Jerry', 'Timid Tabby', 4, 25, 'Yes', 'Yes', 'NA', 19, 4, 1957, 'George, Tom\'s fraidy-cat-look-alike cousin, comes for a visit. Jerry has no knowledge of this, however, so when he sees George freak out upon seeing him, he decides to scare him some more, but not always working as he sometimes gets Tom.', 'Y', 'N', 0),
	('Tom And Jerry', 'Feeding The Kiddie', 4, 26, 'Yes', 'Yes', 'NA', 7, 6, 1957, 'This is a CinemaScope remake of the 1949 episode, The Little Orphan.', 'Y', 'N', 0),
	('Tom And Jerry', 'Mucho Mouse', 4, 27, 'Yes', 'Yes', 'NA', 6, 9, 1957, 'Taking place in Spain, Meathead the Cat is ordered by his owner to catch El Magnifico at once, but Meathead says that\'s impossible because of El Magnifico\'s world-renowned escaping skills. So the owner decides to call up Tom, the \'Olympic, U.S. and World Champion Mouse Catcher\', confident that he will be able to do the job.', 'Y', 'N', 0),
	('Tom And Jerry', 'Tom\'s Photo Finish', 5, 1, 'Yes', 'Yes', 'NA', 1, 11, 1957, 'Tom frames Spike for stealing food from the fridge only to be caught on film by Jerry. Jerry makes several copies of the photo to try to get Tom in trouble.', 'Y', 'N', 0),
	('Tom And Jerry', 'Happy Go Ducky', 5, 2, 'Yes', 'Yes', 'NA', 3, 1, 1958, 'When the Easter Bunny leaves an egg for Tom and Jerry, it hatches into Quacker. The little duck insists on swimming in everything in the house.', 'Y', 'N', 0),
	('Tom And Jerry', 'Royal Cat Nap', 5, 3, 'Yes', 'Yes', 'NA', 7, 3, 1958, 'The king is about to take a nap, and tells Tom that if he hears one sound and wakes up, it\'s off with his head!', 'Y', 'N', 0),
