	('Tom And Jerry', 'Mush Ado About Mousing', 5, 23, 'Yes', 'Yes', 'NA', 24, 5, 1964, 'Jerry is rescued from Tom by a dog who gives him a whistle and tells him to blow it, and he will come to his rescue. In order for the dog not to hear the whistle, Tom puts earmuffs on him while he\'s sleeping. Later, however, Jerry shows up in front of Tom, holding what is seemingly the same pair of earmuffs.', 'Y', 'N', 0),
