	('Tom And Jerry', 'The A-Tom-Inable-Snowman', 6, 15, 'Yes', 'Yes', 'NA', 20, 6, 1966, 'Tom tries to catch Jerry, who is hiding in a cuckoo clock, but ends up eating a tiny bomb, instead. He chases after Jerry wearing skis, and Jerry is safe inside with a Saint Bernard. Tom places his skis in snow to distract the dog so he can get Jerry. He gets knocked unconscious many times and gets rescued and intoxicated over and over again by the Saint Bernard. He pours Tom some water to soak his feet in, but it ends up burning Tom. He almost forgets Jerry, as he jumps so high because of the water that he lands in a tropical island, where the dog is waiting to rescue Tom when he bumps his head.', 'Y', 'N', 0),
	('Tom And Jerry', 'Catty-Cornered', 6, 16, 'Yes', 'Yes', 'NA', 21, 9, 1966, 'This episode takes place in a duplex. Tom lives in one house, another Cat lives in the other, and Jerry lives between them. Both cats try to catch Jerry, but when one cat tries, the other cat gets hurt, and both think Jerry is the strongest mouse ever. They decide to get away from the damaged house, and Jerry comes with them, since he had so much fun.', 'Y', 'N', 0),
