	('True Detective', 'The Long Bright Dark', 1, 1, 'Yes', 'Yes', 'Yes', 12, 1, 2014, 'Former Louisiana State CID partners Martin Hart and Rustin Cohle give separate statements to a pair of investigators about the murder of a prostitute, Dora Lange, 17 years earlier. As they look back, details of the crime, replete with occult overtones, are accompanied by insights into the detectives volatile partnership and personal lives.', 'Y', 'N', 9),
	('True Detective', 'Seeing Things', 1, 2, 'Yes', 'Yes', 'Yes', 19, 1, 2014, 'Under pressure to land a suspect in the Lange murder, Quesada warns Hart and Cohle that they might be replaced by three detectives from a new task force. The pair lobbies for extra time to follow up on a lead that takes them from a rural cathouse to an incinerated church. With his marriage to Maggie already strained by work, Hart finds respite away from home.', 'Y', 'N', 8.9),
	('True Detective', 'The Locked Room', 1, 3, 'Yes', 'Yes', 'Yes', 26, 1, 2014, 'A hidden image at the burned-out church leads Cohle and Hart to Joel Theriot, a tent-revival minister whose parishioners finger a scarred tall man seen with Dora Lange. Brought in for interrogation, a sex offender matching the description is quickly dismissed by Cohle, despite offering a confession. Hart gets sidetracked after Maggie sets Cohle up with a friend at a C&W bar. Looking to establish a pattern of murder, Cohle pores over old case files, finding a connection with a woman assumed to have drowned years earlier.', 'Y', 'N', 9.2),
	('True Detective', 'Who Goes There', 1, 4, 'Yes', 'Yes', 'Yes', 9, 2, 2014, 'Hart and Cohle hunt for their newly identified suspect, Reggie Ledoux, a meth cooker who shared a cell with Dora Lange\'s husband and recently skipped parole. As Hart\'s personal life collapses around him, Cohle immerses himself in an old criminal identity from his narco days, contacting an East-Texas biker gang known to deal with their primary suspect. Cohle\'s undercover work takes him to a dangerous edge where the law has no place, and both men must confront the cost of living a false life.', 'Y', 'N', 9.7),
	('True Detective', 'The Secret Fate Of All Life', 1, 5, 'Yes', 'Yes', 'Yes', 16, 2, 2014, 'A violent denouement in the forest clears the Dora Lange case and turns Cohle and Hart into local heroes. Each man settles into a healthier rhythm of living as Hart returns to his family, and Cohle starts a relationship while gaining a reputation as a closer in interrogations. As time passes and his daughters grow older, Hart faces new tensions and temptations, and Cohle learns from a double-murder suspect that there could be much more to an old case than he\'d once thought. In 2012, Gilbough and Papania put their cards on the table, presenting new intelligence that threatens Cohle and causes Hart to reassess everything he thought he knew about his former partner.', 'Y', 'N', 9.6),
	('True Detective', 'Haunted Houses', 1, 6, 'Yes', 'Yes', 'Yes', 23, 2, 2014, 'In 2002, Cohle and Hart begin to fall back to familiar and violent obsessions. Hart exacts savage vengeance on a pair of teenage boys, and Cohle becomes convinced they left something undone in 1995. Working on his own, Cohle traces a sinister connection between missing children along the coast and evangelist Billy Lee Tuttle\'s Wellsprings Program. Hart is reintroduced to a former prostitute he met during the Lange investigation. In 2012, Papania and Gilbough question Maggie, now divorced from Marty, about Cohle and Hart during 2002, the year their relationship fractured and Cohle quit the force following a suspension.', 'Y', 'N', 9.2),
	('True Detective', 'After You\'ve Gone', 1, 7, 'Yes', 'Yes', 'Yes', 2, 3, 2014, 'Hart and Cohle call a truce to investigate a series of disappearances that may be related to the Dora Lange murder and the Tuttle family.', 'Y', 'N', 9.2),
