	('Veep', 'Fundraiser', 1, 1, 'Yes', 'Yes', 'Yes', 22, 4, 2012, 'Vice President Selina Meyer and her staff - chief of staff Amy, spokesperson Mike, right-hand man Gary, and executive assistant Sue - are still finding their footing in Washington D.C. Selina decides to make the Clean Jobs Commission a pet project, but a series of missteps requires her staff to work damage control.', 'Y', 'N', 7.3),
	('Veep', 'Frozen Yoghurt', 1, 2, 'Yes', 'Yes', 'Yes', 29, 4, 2012, 'After getting good news on a clean-jobs bill, the staff brainstorm for a photo-op idea, but the trip to a local frozen-yoghurt shop is delayed by a stop in the White House Situation Room and a gastrointestinal illness that\'s going around.', 'Y', 'N', 7.7),
	('Veep', 'Catherine', 1, 3, 'Yes', 'Yes', 'Yes', 6, 5, 2012, 'Selina celebrates 20 years in Washington, D.C., but tries to keep a low profile after a newspaper article paints her as a diva and rumors float about her feud with the first lady. Meanwhile, Selinas college-age daughter arrives for a visit, and is surprised that her mother is looking for a dog but appalled by her reaction to Selina being on the list of names for hurricanes.', 'Y', 'N', 7.8),
	('Veep', 'Chung', 1, 4, 'Yes', 'Yes', 'Yes', 13, 5, 2012, 'Dan and Amy try to figure out if an Asian-American war hero-cum-governor could be a political threat to Selina. Meanwhile, Selina and Mike prep for her \'Meet the Press\' interview; and Gary and Amy make a startling discovery about Selina\'s romantic life.', 'Y', 'N', 7.8),
	('Veep', 'Nicknames', 1, 5, 'Yes', 'Yes', 'Yes', 20, 5, 2012, 'Bloggers\' nicknames for Selina become her next obsession. Dan goes on a fact-finding mission after his boss is snubbed by the president, it\'s make-or-break time for the clean-jobs bill.', 'Y', 'N', 8),
	('Veep', 'Baseball', 1, 6, 'Yes', 'Yes', 'Yes', 27, 5, 2012, 'Selina attends a healthy eating event at Camden Yards with some very grumpy fast-food executives, where she also confides a secret to Amy. Mike holds a press briefing for some local news pals, save for the inquisitive Leon West. Later, with the Veep delayed, Amy and Dan are forced to entertain elementary school children.', 'Y', 'N', 8.1),
