	('Veep', 'Tears', 1, 8, 'Yes', 'Yes', 'Yes', 10, 6, 2012, 'An Ohio gubernatorial candidate balks at Selina\'s endorsement due to her current unpopularity, but Mike and Amy try to make the best of the vice president\'s emotions during their meeting. Meanwhile, Dan can\'t shake the clean-jobs bill debacle, especially when it could be the subject of a Congressional hearing.', 'Y', 'N', 8.2),
	('Veep', 'Midterms', 2, 1, 'Yes', 'Yes', 'Yes', 14, 4, 2013, 'Fresh off successful campaign appearances for midterm elections, Selina sees an opportunity to expand her role, but must first curry favor with Kent Davison, the president\'s icy senior strategist. Meanwhile, there are new developments in the staff\'s personal lives.', 'Y', 'N', 7.9),
