	('Veep', 'Andrew', 2, 6, 'Yes', 'Yes', 'Yes', 19, 5, 2013, 'Catherine\'s 21st birthday party becomes a forum for Selina\'s budget negotiation with the majority leader, but Amy and Gary are more worried how Selina will handle seeing her ex-husband. Meanwhile, Mike discusses Selina\'s role in the Uzbek hostage crisis with the press.', 'Y', 'N', 8),
