	('Veep', 'Running', 2, 9, 'Yes', 'Yes', 'Yes', 16, 6, 2013, 'The Veep continues her plans. Dan attempts to play both sides of the Selina-Danny Chung rivalry.', 'Y', 'N', 8.6),
	('Veep', 'D.C.', 2, 10, 'Yes', 'Yes', 'Yes', 23, 6, 2013, 'With the administration in full crisis mode, Selina and her staff try to cope.', 'Y', 'N', 8.8),
	('Veep', 'Some New Beginnings', 3, 1, 'Yes', 'Yes', 'Yes', 6, 4, 2014, 'In Iowa, Selina courts possible caucus voters at a book signing for her new autobiography, while her team attends a staff wedding in D.C. As the day proceeds, she and her staff get word of a rumor that could affect the next election. ', 'Y', 'N', 8.3),
	('Veep', 'The Choice', 3, 2, 'Yes', 'Yes', 'Yes', 13, 4, 2014, 'After a quick visit to their new campaign HQ, Selina and her team go on a ride-along with the Coast Guard, where they learn the president has flipped on a major issue, which makes Selina reexamine her own stance. Meanwhile, Gary questions his role with the Veep, and Jonah\'s new political blog causes trouble. ', 'Y', 'N', 8.2),
	('Veep', 'Alicia', 3, 3, 'Yes', 'Yes', 'Yes', 20, 4, 2014, 'While Selina and her staff prepare for an Annapolis event where she will announce her candidacy, Dan gets word that \'Saturday Night Live\' has done a not-so-flattering sketch about her. ', 'Y', 'N', 8.5),
	('Veep', 'Clovis', 3, 4, 'Yes', 'Yes', 'Yes', 27, 4, 2014, 'On a fundraising trip in Silicon Valley, Selina is challenged by an anti-fracking mom and visits the campus of Clovis, a tech company with an ambitious young CEO. In D.C., Jonah makes a crude viral video of the Selina-mom encounter, and Dan, with Ben\'s help, gets an idea for a rumor he can spread against Chung. ', 'Y', 'N', 8.3),
	('Veep', 'Fishing', 3, 5, 'Yes', 'Yes', 'Yes', 4, 5, 2014, 'Selina has a secret lunch with a major strategist she may tap as her campaign manager, even as Amy and Dan are openly vying for the job. Meanwhile, Defense Secretary Maddox invites the vice president to his country estate; Gary gets bad news about his shoulder; and Mike\'s colleagues find out he\'s mixing business with pleasure.', 'Y', 'N', 8.2),
	('Veep', 'Detroit', 3, 6, 'Yes', 'Yes', 'Yes', 11, 5, 2014, 'At an economic summit in Detroit, Selinas staff and her family are peeved by the presence of her new personal trainer. Meanwhile, Jonah and Mike negotiate a photo-op with Selina and Maddox. Later, Catherine protects her mom from a protestor, and Selina attends a womens gun show.  ', 'Y', 'N', 8.2),
	('Veep', 'Special Relationship', 3, 7, 'Yes', 'Yes', 'Yes', 18, 5, 2014, 'In the U.K. for the 100th anniversary of WWI, Selinas staff worries about Rays growing influence on the Veep. Meanwhile, Dans nerves begin to fray as Ben gets news that sends him back to D.C. Later, Jonah arrives in London, U.K. to spy for Team Maddox, and Amy leaks a secret.', 'Y', 'N', 8.4),
	('Veep', 'Debate', 3, 8, 'Yes', 'Yes', 'Yes', 1, 6, 2014, 'Selina and the staff prep for her debate with George Maddox, Danny Chung, congressman Owen Pierce and Joe Thornhill, a major-league baseball manager who recently entered the race. Dan returns with a rosier outlook. Wendy, Mike\'s wife, arrives to do a style piece on Selina, but eyes a bigger story involving Ray. ', 'Y', 'N', 8.8),
	('Veep', 'Crate', 3, 9, 'Yes', 'Yes', 'Yes', 8, 6, 2014, 'With Thornhill ahead in the polls, Selina and her staff discuss how to make her more \'folksy.\' In need of a job, Jonah meets with Bill Ericsson. Selina has an interview with pretentious journalist Quincy Carter. ', 'Y', 'N', 8.9),
	('Veep', 'New Hampshire', 3, 10, 'Yes', 'Yes', 'Yes', 8, 6, 2014, 'Three days before the New Hampshire primary, Selina and her staff juggle her multiple official obligations and campaign appearances. ', 'Y', 'N', 8.6),
	('Veep', 'Joint Session', 4, 1, 'Yes', 'Yes', 'Yes', 12, 4, 2015, 'Selina\'s staff frantically works on her first major speech as president. Gary questions his worth.', 'Y', 'N', 8.6),
	('Veep', 'East Wing', 4, 2, 'Yes', 'Yes', 'Yes', 19, 4, 2015, 'The presidents staff prepares for her state visit with the Israeli prime minister. Mike tries out a new look for his more visible role. Teddy does Jonah a favor, while continuing to invade his personal space. Stuck in traffic with Richard, Amy learns via FaceTime that Selina is bringing in a new director of communications. Gary goes overboard while planning the state dinner for the Israeli delegation, and a painting in the White House comes into the spotlight.', 'Y', 'N', 8.5),
	('Veep', 'Data', 4, 3, 'Yes', 'Yes', 'Yes', 26, 4, 2015, 'Selina\'s team tries to find a scapegoat. Catherine wants to support an anti-bullying campaign.', 'Y', 'N', 8.4),
	('Veep', 'Tehran', 4, 4, 'Yes', 'Yes', 'Yes', 3, 5, 2015, 'As part of her Middle East peace-talks tour, President Meyer makes an historic trip to Iran, where an American reporter is being detained. In D.C., Dan is wooed by lobbyist Sidney Purcell, while VP Doyle stands in for the president at a Rainbow Jersey event with a gay NBA star. Meanwhile, Kents polling and Jonahs big mouth may cause trouble for Selina.', 'Y', 'N', 8.4),
	('Veep', 'Convention', 4, 5, 'Yes', 'Yes', 'Yes', 10, 5, 2015, 'At the party convention, Selina and her staff scramble against the clock to avert a major internal crisis. Amy grows increasingly infuriated with the presidents new advisor, Karen, who is coaching a nervous Catherine on her First Daughter speech to the convention. Back in D.C., Dan recruits Jonah and Richard to pose as influential Washington insiders.', 'Y', 'N', 9),
	('Veep', 'Storms And Pancakes', 4, 6, 'Yes', 'Yes', 'Yes', 17, 5, 2015, 'On the campaign trail, Selina is annoyed by press reaction to her running mates effortless charm and decides to attend a pancake-brunch fundraiser without any of her team on hand to help. When news arrives that a major hurricane is about to hit North Carolina, it looks like it could be good news for her image. In D.C., Amy tries to adjust to her new post-White House life, and Jonah gets bizarrely ambushed at what he thinks is a job interview.', 'Y', 'N', 8.1),
	('Veep', 'Mommy Meyer', 4, 7, 'Yes', 'Yes', 'Yes', 24, 5, 2015, 'A dramatic incident in the White House leaves the president shaken, while at a Q&A, Tom James speaks out and makes her day even worse. As Mike tries to sell the press on Selinas Families First bill, Sue and Gary prepare for the presidents White House dinner with old friends. Jonah and Richard inadvertently reveal a terrible secret, while Dan and Amy find themselves at a lobbying event for the concrete industry.', 'Y', 'N', 8.3),
	('Veep', 'B-ill', 4, 8, 'Yes', 'Yes', 'Yes', 31, 5, 2015, 'With the Families First Bill growing increasingly toxic, Gary sets up a clandestine meeting with Dan and Amy to persuade them to lobby against it. Meanwhile, Selina attempts to keep working while ill in bed with the flu. As the vote on Families First draws near, her staff works to ensure the deciding vote will go in their favor, as it becomes clear that victory or defeat lies in the hands of just one congressman.', 'Y', 'N', 8.4),
	('Veep', 'Testimony', 4, 9, 'Yes', 'Yes', 'Yes', 7, 6, 2015, 'While Selina fields questions from the press, members of her staff testify before a congressional committee about whether the Families First vote was intentionally sabotaged  and who was really behind the data breach.', 'Y', 'N', 8.9),
	('Veep', 'Election Night', 4, 10, 'Yes', 'Yes', 'Yes', 14, 6, 2015, 'On election night, Selina and her staff find their nerves growing frayed as each state result is called.', 'Y', 'N', 9.1),
	('Veep', 'Morning After', 5, 1, 'Yes', 'Yes', 'Yes', 24, 4, 2016, 'It\'s the day after the election, and Selina thinks she\'s found a path to victory. Meanwhile, Catherine starts making a behind-the-scenes documentary; Amy isn\'t sure if she\'s back on the team; Dan mulls a new career; and Mike and Wendy plan to adopt a baby from China.', 'Y', 'N', 8.6),
	('Veep', 'Nev-AD-A', 5, 2, 'Yes', 'Yes', 'Yes', 1, 5, 2016, 'Amy, Dan, Jonah and Richard go all out to win the election for Selina. Meanwhile, Tom is unceremoniously ousted from the new banking task force; a well-known D.C. fixture joins the team; Seina meets a Wall Street titan; Mike aims to improve his health before becoming a father; and Kent is curious about Sue\'s age.', 'Y', 'N', 8.3),
	('Veep', 'The Eagle', 5, 3, 'Yes', 'Yes', 'Yes', 8, 5, 2016, 'Fallout from Selina\'s tweet gives Mike a major headache. Amy is unsettled by Bob\'s power grab. Gary finds himself the bee\'s knees at a museum gala.', 'Y', 'N', 8.5),
	('Veep', 'Mother', 5, 4, 'Yes', 'Yes', 'Yes', 15, 5, 2016, 'Selina rushes to the hospital while attempting to win the presidency. Amy and Dan discover the OBrien camp has staged a fake protest, and task Jonah and Richard with organizing their own pro-POTUS demonstration. Mike and Wendy meet with a potential surrogate.', 'Y', 'N', 9),
	('Veep', 'Thanksgiving', 5, 5, 'Yes', 'Yes', 'Yes', 22, 5, 2016, 'Selina celebrates Thanksgiving in her own special way. Ben and Kent manage a Thanksgiving Day crisis, deploying Tom James and VP Doyle to make statements in Selinas absence. Ben sends Dan to work for Tom James.', 'Y', 'N', 8.2),
	('Veep', 'C--tgate', 5, 6, 'Yes', 'Yes', 'Yes', 29, 5, 2016, 'With the U.S. on the brink of a major financial meltdown, Selina must make an important decision. Jonah finds himself back in New Hampshire. Amy investigates the staff, and Catherine tries to get time with Selina to share major news.', 'Y', 'N', 8.8),
	('Veep', 'Congressional Ball', 5, 7, 'Yes', 'Yes', 'Yes', 5, 6, 2016, 'The White House Christmas party finds Selina canvassing for votes to break the election tie. Meanwhile, the \'50 Hottest D.C. Staffers\' list is on everyone\'s lips in the West Wing; Mike mulls a career move; and Dan helps Jonah hone his debate skills in New Hampshire.', 'Y', 'N', 8.9),
	('Veep', 'Camp David', 5, 8, 'Yes', 'Yes', 'Yes', 12, 6, 2016, 'A pre-Christmas celebration for Selina\'s family at Camp David camouflages her team\'s secret negotiations. Amy and Dan work on Jonah\'s human side after a terrible debate performance in New Hampshire.', 'Y', 'N', 8.8),
	('Veep', 'Kissing Your Sister', 5, 9, 'Yes', 'Yes', 'Yes', 19, 6, 2016, 'Catherine and Marjorie have a fight. Mike prepares for his babies. Selina is interviewed.', 'Y', 'N', 9.2),
	('Veep', 'Inauguration', 5, 10, 'Yes', 'Yes', 'Yes', 26, 6, 2016, 'Selina and her staff prepare for inauguration day. Mike suffers from exhaustion. Catherine gets a makeover.', 'Y', 'N', 8.6),
	('Veep', 'Omaha', 6, 1, 'Yes', 'Yes', 'No', 16, 4, 2017, 'One year after losing the presidency, Selina attempts to secure her legacy. Dan tries to ingratiate himself at his new job. Amys brash D.C.-style personality proves too much for her new co-workers.', 'N', 'N', 7.9),
	('Veep', 'Library', 6, 2, 'Yes', 'Yes', 'No', 23, 4, 2017, 'Selina attends the opening of President Hughes library. Jonah gets advice on how to rise in the political ranks. Dan suffers through Janes whims. Amy releases an attack ad.', 'N', 'N', 8.3),
	('Veep', 'Georgia', 6, 3, 'Yes', 'Yes', 'No', 30, 4, 2017, 'Selina helps monitor the first free and democratic election in Georgia (the country) and is reunited with an old friend. Mike and Gary hide evidence of a major mishap. Jonah and Richard have an eventful night out. Back in the U.S., Dan  tries to help Amy.', 'N', 'N', 8.3),
	('Veep', 'Justice', 6, 4, 'Yes', 'Yes', 'No', 7, 5, 2017, 'Selina and her team attend the funeral of a Supreme Court justice. Amy works on securing a location for Selinas library. Dan tries to maintain his upswing with Jane, his co-host. Jonah finds an issue.', 'N', 'N', 8.2),
	('Veep', 'Chicklet', 6, 5, 'Yes', 'Yes', 'No', 14, 5, 2017, 'Selina settles on a location for her library. Dan gets a gossip column. Mike helps Selina with her book. Jonah tries to nail down a big donation. Gary manages a minor crisis at Madame Tussauds.', 'N', 'N', 8.4),
	('Veep', 'Qatar', 6, 6, 'Yes', 'Yes', 'No', 21, 5, 2017, 'Selina takes a trip to Qatar; Jonah gets a dinner invitation. Dan has an unexpected visit from an HR rep. Catherine and Marjorie have big news to share.', 'N', 'N', 8.2),
	('Veep', 'Blurb', 6, 7, 'Yes', 'Yes', 'No', 28, 5, 2017, 'Selina works on her book as her staff prepare for the ceremony to unveil her portrait. Jonah tries to weasel his way onto the guest list. Dan struggles to solve his on-screen chemistry problem.', 'N', 'N', 8.4),
	('Veep', 'Judge', 6, 8, 'Yes', 'Yes', 'No', 11, 6, 2017, 'Selina takes a trip; Dan woos Jonah to get a coveted interview; Amy convinces Selina to put her in charge of a very disorganized Mike.', 'N', 'N', 8),
	('Veep', 'A Woman First', 6, 9, 'Yes', 'Yes', 'No', 18, 6, 2017, 'Selina\'s book finally arrives; Jonah has an important meeting; Dan, Ben and Kent go out for drinks.', 'N', 'N', 8.5),
	('Veep', 'Groundbreaking', 6, 10, 'Yes', 'Yes', 'No', 25, 6, 2017, 'Selina and her staff get ready for the long-awaited groundbreaking for her library.  Amy seeks clarity on her role.  Jonah asks Dan, Ben and Kent for help.', 'N', 'N', 8.6),
	('Veronica Mars', 'Pilot', 1, 1, 'Yes', 'Yes', 'Yes', 22, 9, 2004, 'While trying to navigate the everyday drama of high school, the smart, fearless, 17-year-old Veronica Mars also moonlights as an apprentice private investigator out to solve her wealthy town of Neptune\'s toughest mysteries. After coming to the aid of the new kid, sophomore Wallace Fennel, who\'s been duct-taped to the school\'s flagpole, Veronica ends up incurring the wrath of the thugs who put him there, Eli \'Weevil\' Navarro and his P.C.H. Biker Boyz. To get Weevil and his gang off her and Wallace\'s case, Veronica devises an intricate plan that helps some of Weevil\'s cronies avoid trouble with the law. Meanwhile, defying her father, Keith Mars, the disgraced former sheriff turned private eye, Veronica pursues a late-night case of adultery against billionaire Jake Kane, only to make an unsettling discovery about her mother, who abandoned Veronica and Keith a year ago.', 'Y', 'N', 7.8),
	('Veronica Mars', 'Credit Where Credit\'s Due', 1, 2, 'Yes', 'Yes', 'Yes', 28, 9, 2004, 'Veronica doesn\'t believe the evidence adds up against Weevil, who has confessed to stealing credit card applications from Logan\'s family, and launches an investigation to help her new ally. Meanwhile, after joining Ms. Mallory Dent\'s newspaper class, Veronica clashes with socialite Caitlin Ford, Logan\'s bombshell girlfriend, but is intrigued by the attention shown to her by another wealthy student, Troy Vandegraff, a friend of ex-boyfriend Duncan. Later, Veronica learns that Lilly got a ticket driving her car on the day she died -- two hours after her supposed time of death.', 'Y', 'N', 6.5),
	('Veronica Mars', 'Meet John Smith', 1, 3, 'Yes', 'Yes', 'Yes', 12, 10, 2004, 'With only a commonplace name, an old address and dim memories as leads, Veronica and Wallace attempt to help classmate Justin Smith find his father John, who disappeared 10 years earlier. Meanwhile, as Veronica faces some complicated feelings towards ex-boyfriend Duncan and new romantic interest Troy, guidance counselor Rebecca James calls Keith to the school to discuss the recent, dramatic changes in his daughter\'s life. Later, Duncan struggles with ways to cope with his sister\'s death as the anniversary of her murder approaches.', 'Y', 'N', 6.8),
	('Veronica Mars', 'The Wrath Of Con', 1, 4, 'Yes', 'Yes', 'Yes', 19, 10, 2004, 'In an effort to help Wallace\'s new crush Georgia, who was duped out of her money in an internet scheme, Veronica must outwit a group of computer \'thugs,\' known as the Silicon Mafia. Meanwhile, Keith makes Veronica introduce him to her new boyfriend Troy before allowing her to go to the homecoming dance with him. Later, Logan helps Duncan edit together a memorial video for a school dedication ceremony marking the one-year anniversary of Lilly\'s death. The dance and the video bring back Veronica\'s memories of when the four of them were friends.', 'Y', 'N', 6.9),
	('Veronica Mars', 'You Think You Know Somebody', 1, 5, 'Yes', 'Yes', 'Yes', 26, 10, 2004, 'Veronica tries to help her new boyfriend Troy find his father\'s stolen car and turns to Weevil for assistance, but the situation becomes dangerous when she discovers that Logan and Troy\'s buddy Luke might have left more than a piata in the car after their night out in Tijuana. While Keith has accepted that his wife is gone and begins dating school guidance counselor Rebecca James, Veronica continues to secretly investigate her mother\'s whereabouts, leading her to stumble on a secret Lianne Mars was keeping.', 'Y', 'N', 7.1),
	('Veronica Mars', 'Return Of The Kane', 1, 6, 'Yes', 'Yes', 'Yes', 2, 11, 2004, 'Veronica investigates possible fraud in the election of student council president at school after Duncan wins, beating a more popular, but less affluent student who promised to eliminate the wealthy students\' on-campus perks. Meanwhile, Logan causes a public relations nightmare for his movie star parents Aaron and Lynn Echolls when footage of him organizing boxing matches between homeless men is posted on the internet and leaked to the media. Later, Veronica and Keith learn that the man who admitted to murdering Lilly is set to be executed, but a second look at crime scene photographs puts his confession in question.', 'Y', 'N', 6.9),
	('Veronica Mars', 'The Girl Next Door', 1, 7, 'Yes', 'Yes', 'Yes', 9, 11, 2004, 'Veronica becomes suspicious when a young pregnant woman who lives in their apartment complex with her volatile boyfriend suddenly disappears; fearing the worst, Keith steps in to help his daughter investigate this case for the girl\'s estranged parents. Meanwhile, Logan and Weevil get thrown into detention together after arguing with a teacher, leading the rivals to discover some surprising things in common. Later, while working on an alumni photo project in her journalism class, Veronica is shocked to discover in the \'79 yearbook that her mother and Jake Kane were high-school sweethearts.', 'Y', 'N', 6.7),
	('Veronica Mars', 'Like A Virgin', 1, 8, 'Yes', 'Yes', 'Yes', 23, 11, 2004, 'To help restore a cheerleader\'s ruined reputation, Veronica turns to funky computer geek Mac to find the hacker responsible for leaking the embarrassing, private results of a popular online \'purity test\' to all of Neptune High. Meanwhile, Keith helps Wallace and his mom with an unruly tenant in their building. Later, to get answers about Lilly\'s murder, Veronica attempts to visit Lilly\'s confessed, condemned killer Abel Koontz in prison.', 'Y', 'N', 7.2),
	('Veronica Mars', 'Drinking The Kool-Aid', 1, 9, 'Yes', 'Yes', 'Yes', 30, 11, 2004, 'The wealthy parents of a Neptune High senior hire Keith and Veronica to investigate a cult-like group and its charismatic leader after their son Casey moves out to live on the collective farm. Meanwhile, Veronica attempts to get to the bottom of Abel Koontz\' claim that her real father is Jake Kane.', 'Y', 'N', 6.7),
	('Veronica Mars', 'An Echolls Family Christmas', 1, 10, 'Yes', 'Yes', 'Yes', 14, 12, 2004, 'When Weevil\'s poker winnings go missing after a game at Logan\'s place, Veronica questions each player to piece together the evening\'s events and catch the thief. Meanwhile, on the eve of the Echolls\' annual Christmas party extravaganza, Keith is hired by Lynn Echolls to track down one of her husband Aaron\'s potential stalkers.', 'Y', 'N', 7.5),
	('Veronica Mars', 'Silence Of The Lambs', 1, 11, 'Yes', 'Yes', 'Yes', 4, 1, 2005, 'Veronica uncovers information that her fellow outcast Mac was switched at birth with a more affluent student, causing Veronica to examine her own questions about whom her real father may be. Meanwhile, a serial killer has resurfaced in Neptune forcing Sheriff Lamb to forge a reluctant, tense partnership with Keith. Later, Veronica flirts with a handsome young rookie at the sheriff\'s department to obtain more information on Lilly\'s murder.', 'Y', 'N', 7.1),
	('Veronica Mars', 'Clash Of The Tritons', 1, 12, 'Yes', 'Yes', 'Yes', 11, 1, 2005, 'When a family accuses Veronica of providing a fake ID to their son, now in an alcohol-induced coma, and files suit, the search to find who\'s really responsible leads Veronica to a clandestine, exclusive organization operating on Neptune High\'s campus with a possible connection to Duncan. Meanwhile, Aaron Echolls hires Keith to find out who\'s been supplying pictures to the tabloids that have humiliated his wife Lynn. Later, Veronica bugs Ms. James\' office to eavesdrop on grief counseling sessions, and learns some surprising information about her friends.', 'Y', 'N', 6.8),
	('Veronica Mars', 'Lord Of The Bling', 1, 13, 'Yes', 'Yes', 'Yes', 8, 2, 2005, 'After being hired by hip-hop heavyweight Percy \'Bone\' Hamilton to find his kidnapped daughter, Veronica and Keith look to the music mogul\'s long list of enemies, family members and the girl\'s Neptune High social circle for clues on her whereabouts. Meanwhile, following Lynn Echolls\' apparent suicide, Logan cynically endures his father Aaron\'s effusive displays of grief as they prepare for her memorial ceremony.', 'Y', 'N', 6.4),
	('Veronica Mars', 'Mars Vs Mars', 1, 14, 'Yes', 'Yes', 'Yes', 15, 2, 2005, 'When one of Neptune High\'s haughtier students brings a sexual harassment suit against a favorite teacher, Veronica finds herself pitted against her father when the girl\'s parents hire Keith to help in their case. Meanwhile, with the tabloids claiming his mom is still alive, Logan turns to Veronica to help him track down the truth. Later, Veronica discovers more unsettling information about Duncan\'s hidden medical condition.', 'Y', 'N', 7.3),
	('Veronica Mars', 'Ruskie Business', 1, 15, 'Yes', 'Yes', 'Yes', 22, 2, 2005, 'Veronica surprisingly finds herself working as a \'love detective\' when she\'s asked to track down her friend Meg\'s secret admirer and a Russian bride\'s estranged fianc. Meanwhile, after discovering that one of Lynn Echolls\' credit cards is in use, Veronica and Logan go to a Los Angeles hotel in hopes of finding her or a clue.', 'Y', 'N', 7.1),
	('Veronica Mars', 'Betty And Veronica', 1, 16, 'Yes', 'Yes', 'Yes', 29, 3, 2005, 'Following an emotional reunion with her mother, Veronica is hired to track down Neptune High\'s beloved mascot, Polly the Parrot, which was apparently kidnapped by a rival school on the eve of a big basketball game. Meanwhile, with her suspicions about the Kane family rekindled, Veronica attempts to gain access to her father\'s original interrogation tapes. Later, Veronica\'s relationship with Deputy Leo heats up, as does Meg\'s relationship with Duncan.', 'Y', 'N', 6.8),
	('Veronica Mars', 'Kanes And Abel\'s', 1, 17, 'Yes', 'Yes', 'Yes', 5, 4, 2005, 'Veronica investigates who at school is doing everything possible to distract Sabrina from studying and wreck her grades in an obvious attempt to sabotage her chances at becoming valedictorian. Meanwhile, an unsavory, rival private investigator makes Keith a business offer. Later, Veronica pursues a risky lead that could discredit Abel Koontz\'s confession, as Logan stumbles onto her detailed files on everyone connected to Lilly\'s murder.', 'Y', 'N', 6.8),
	('Veronica Mars', 'Weapons Of Class Destruction', 1, 18, 'Yes', 'Yes', 'Yes', 12, 4, 2005, 'A series of fire drills leads Veronica to discover that Neptune High has been receiving bomb threats, so she enlists Wallace and Mac\'s help to investigate classmates who could pose a serious threat to the school, including new student Ben. Meanwhile, Keith stuns Veronica with the news of who he\'s been secretly dating. Later, Duncan confronts Veronica about her ongoing investigation into his sister\'s death.', 'Y', 'N', 7.3),
	('Veronica Mars', 'Hot Dogs', 1, 19, 'Yes', 'Yes', 'Yes', 19, 4, 2005, 'While helping her classmate Mandy search for her missing Jack Russell terrier, Veronica stumbles onto a bigger mystery, which affects pets all over Neptune. Meanwhile, tensions mount in the Echolls family as Trina tries to convince the now-retired Aaron to take a part in her new boyfriend\'s independent movie. Later, Weevil is arrested for breaking into the Kane residence and taking something from Lilly\'s room.', 'Y', 'N', 6.8),
	('Veronica Mars', 'M.A.D', 1, 20, 'Yes', 'Yes', 'Yes', 26, 4, 2005, 'When a classmate\'s boyfriend threatens to post a humiliating video of the girl online if she dumps him, Veronica helps her concoct a scheme to ensure \'mutually assured destruction\' if he doesn\'t allow the relationship to end peacefully. Meanwhile, Keith begins to search for Duncan after his parents post a huge reward for information on his whereabouts. Later, as her secret new relationship heats up, Veronica learns a disturbing new fact about the night that she was drugged and assaulted.', 'Y', 'N', 7),
	('Veronica Mars', 'A Trip To The Dentist', 1, 21, 'Yes', 'Yes', 'Yes', 3, 5, 2005, 'Determined to get to the truth behind who drugged and assaulted her at a party the year before, Veronica questions her friends and many rivals about the chain of events that night at Shelley Pomroy\'s house. Meanwhile, when one of Veronica and Wallace\'s stunts affects her job at Kane Software, Alicia confronts Keith about his daughter\'s behavior. Later, in an attempt to get closer to his son, Aaron throws a birthday party for Logan that inadvertently surprises everyone.', 'Y', 'N', 7.7),
	('Veronica Mars', 'Leave It To Beaver', 1, 22, 'Yes', 'Yes', 'Yes', 10, 5, 2005, 'In the shocking, action-packed season finale, a determined Veronica must betray someone she cares deeply about in order to solve the season-long mystery of who murdered her best friend Lilly Kane, but what she discovers puts her life in serious danger. Meanwhile, on the eve of a reception for the Governor of Calif., Jake Kane asks Duncan if he really wants to know what happened on the night Lilly died. Later, Keith awaits the results of a paternity test.', 'Y', 'N', 8.3),
	('Veronica Mars', 'Normal Is The Watchword', 2, 1, 'Yes', 'Yes', 'Yes', 28, 9, 2005, 'After the summer fireworks caused by a dangerous confrontation with Lilly Kane\'s murderer and a surprising visitor at her door, Veronica attempts to settle into \'normal\' life, complete with a new after-school job and a return to the popular fold at Neptune High, but she gets pulled back into the investigation business when Wallace is kicked off the basketball team for testing positive for drugs.Meanwhile, Keith sits down with reporter Julie Chen to discuss his new book on the Lilly Kane murder, \'Big Murder, Small Town.\' Later, after seeing his father arrested for murder and being charged and tried for murder himself, Logan seeks refuge from the paparazzi and relaxes poolside at the Casablancas mansion with buddies Dick and \'Beaver\'  and their sexy stepmother Kendall.', 'Y', 'N', 7.1),
	('Veronica Mars', 'Driver Ed', 2, 2, 'Yes', 'Yes', 'Yes', 5, 10, 2005, 'After tragedy strikes Neptune, Calif. and the local sheriff rushes to judgment, an emotional Veronica attempts to help a grieving family member rule out suicide as a contributing cause in the calamity. Meanwhile, Wallace offers to help transfer student Jackie Cook, the fiery, flirty daughter of professional baseball player Terrence Cook, track down the person who damaged her car in the school lot. Later, mayoral candidate Woody Goodman asks Keith to consider running for sheriff.', 'Y', 'N', 6.6),
	('Veronica Mars', 'Cheatty Cheatty Bang Bang', 2, 3, 'Yes', 'Yes', 'Yes', 12, 10, 2005, 'Beaver hires Veronica to investigate his stepmother, Kendall, who he believes is cheating on his dad and planning to clean him out, but both are shocked by what they discover. Meanwhile, Wallace begins dating Jackie, against Veronica\'s advice.', 'Y', 'N', 6.7),
	('Veronica Mars', 'Green-Eyed Monster', 2, 4, 'Yes', 'Yes', 'Yes', 19, 10, 2005, 'While dealing with her own feelings of jealousy regarding Duncan, Veronica helps a young woman who believes that her new fiance is secretly after her fortune by sifting through his background and even posing as a sexy, available coed to entrap the guy.', 'Y', 'N', 6.3),
	('Veronica Mars', 'Blast From The Past', 2, 5, 'Yes', 'Yes', 'Yes', 26, 10, 2005, 'Deciding to give Jackie the benefit of the doubt since she\'s dating Wallace, Veronica tries to help Jackie determine who stole her credit card, leading Veronica to appear on a psychic\'s community access show to pursue a lead. Meanwhile, Wallace confronts his mother Alicia about who his real father is. Later, Veronica learns of a voice mail recording from one of the students that died, made at the moment the bus crash.', 'Y', 'N', 6.4),
	('Veronica Mars', 'Rat Saw God', 2, 6, 'Yes', 'Yes', 'Yes', 9, 11, 2005, 'With Aaron Echolls facing trial for Lilly\'s murder, the previously accused Abel Koontz appears to enlist Veronica\'s help in finding his missing daughter Amelia, leading to a confrontation with Kane Software\'s head of security. Meanwhile, Logan is arrested', 'Y', 'N', 6.8),
	('Veronica Mars', 'Nobody Puts Baby In A Corner', 2, 7, 'Yes', 'Yes', 'Yes', 16, 11, 2005, 'Veronica and Duncan discover that the still-comatose Meg had been babysitting an abused child, leading Veronica to take on an unfamiliar role as a babysitter to determine the kid\'s identity. Meanwhile, Kendall continues her affair with Logan as her stepson.', 'Y', 'N', 6.7),
	('Veronica Mars', 'Ahoy, Mateys!', 2, 8, 'Yes', 'Yes', 'Yes', 23, 11, 2005, 'Veronica helps Keith determine who is haunting a school bus crash victim\'s parents, currently embroiled in a suit against the school district for negligence.Meanwhile, after Logan asks for help fighting the murder charge against him, Veronica stumbles', 'Y', 'N', 6.5),
	('Veronica Mars', 'My Mother, The Fiend', 2, 9, 'Yes', 'Yes', 'Yes', 30, 11, 2005, 'After Veronica gets busted for breaking into the school office and ordered in detention to reorganize the school\'s files, she stumbles on her mother\'s permanent record and learns that she was suspended for reasons that cause Veronica to further question e', 'Y', 'N', 6.6),
	('Veronica Mars', 'One Angry Veronica', 2, 10, 'Yes', 'Yes', 'Yes', 7, 12, 2005, 'Called to jury duty over Christmas break, Veronica must sit on a difficult, polarizing case against a pair of affluent 09\'er defendants accused of assaulting a young Hispanic woman. Meanwhile, when the Aaron Echolls/Lilly Kane sex tapes go missing from the evidence lock-up, Keith is tasked with locating and retrieving them.', 'Y', 'N', 6.7),
	('Veronica Mars', 'Donut Run', 2, 11, 'Yes', 'Yes', 'Yes', 25, 1, 2006, 'When Duncan disappears with Meg\'s baby, Lamb must work with two FBI agents to extract as much information as possible from an uncooperative Veronica. Meanwhile, Wallace reveals the real reason he returned to Neptune, and Weevil and Logan make a breakthrough in their hunt for the rogue gang member.', 'Y', 'N', 7.2),
	('Veronica Mars', 'Rashard And Wallace Go To White Castle', 2, 12, 'Yes', 'Yes', 'Yes', 1, 2, 2006, 'Wallace\'s hopes of escaping his trouble in Chicago are dashed when Rashard\'s uncle accuses him in the press of a hit and run. Meanwhile, Weevil has Veronica bug a church confessional to smoke out the traitor in his bike gang.', 'Y', 'N', 6.4),
	('Veronica Mars', 'Ain\'t No Magic Mountain High Enough', 2, 13, 'Yes', 'Yes', 'Yes', 8, 2, 2006, 'When the profits from the Neptune High Winter Carnival go missing, Veronica finds herself defending Jackie from the condemning teachers and students. Meanwhile, Keith meets with her father, Terrence Cook, after he is accused of playing a role in the bus crash, and Logan initiates a new relationship while Beaver continues an old one.', 'Y', 'N', 6.8),
	('Veronica Mars', 'Versatile Toppings', 2, 14, 'Yes', 'Yes', 'Yes', 15, 3, 2006, 'When a private website for Neptune High\'s gay students is hacked, and the members blackmailed, Veronica finds it difficult to track down the culprit when the victims want to remain anonymous. Meanwhile, Hannah finds out Logan\'s true intentions, and Keith believes he has found an alibi for Terrence.', 'Y', 'N', 6.4),
	('Veronica Mars', 'The Quick And The Wed', 2, 15, 'Yes', 'Yes', 'Yes', 22, 3, 2006, 'Wallace\'s new girlfriend Jane enlists Veronica\'s help when her older sister Heidi appears to be a \'runaway bride,\' but the clues suggest something possibly more disturbing happened on the way to the altar. Meanwhile, Keith and Veronica decide that they have no choice but to go to Sheriff Lamb with the evidence they\'ve uncovered about the bus crash. Later, Kendall has a tempting offer for Aaron Echolls.', 'Y', 'N', 6.2),
	('Veronica Mars', 'The Rapes Of Graff', 2, 16, 'Yes', 'Yes', 'Yes', 29, 3, 2006, 'While accompanying Wallace to Hearst College, she runs into her ex, Troy Vandergraff, who enlists her help when he is accused of date rape. Meanwhile, Keith helps Cliff with a personal problem involving a prostitute, and Logan makes a decision regarding his relationship with Hannah.', 'Y', 'N', 6.6),
	('Veronica Mars', 'Plan B', 2, 17, 'Yes', 'Yes', 'Yes', 5, 4, 2006, 'Overcome with guilt and frustration, Weevil asks Veronica for help to bring Felix\'s true killer to justice, but realizes he may have to take matters into his own hands.Meanwhile, Keith reviews a strange DVD that Woody receives in the mail, and relationship troubles brew between Wallace and Jane, and Mac and Cassidy.', 'Y', 'N', 6.9),
	('Veronica Mars', 'I Am God', 2, 18, 'Yes', 'Yes', 'Yes', 11, 4, 2006, 'Veronica begins having dreams involving the dead students from the bus crash, who drop clues along the way. Meanwhile, Logan and Wallace become unlikely lab partners in Mr. Wu\'s class, and Keith helps Clemmons expose a doctor\'s scam.', 'Y', 'N', 6.7),
	('Veronica Mars', 'Nevermind The Buttocks', 2, 19, 'Yes', 'Yes', 'Yes', 18, 4, 2006, 'What promises to be a simple case of finding out who ran over a classmate\'s dog turns into a startling revelation when new secrets about the bus crash come pouring out and Veronica finds herself again revisiting Lilly\'s murder case. Meanwhile, Wallace and Jackie try to turn their relationship around the corner, and the PCHers turn to Weevil for protection from the Fitzpatricks.', 'Y', 'N', 6.5),
	('Veronica Mars', 'Look Who\'s Stalking', 2, 20, 'Yes', 'Yes', 'Yes', 25, 4, 2006, 'Gia enlists Veronica\'s help to find out who is stalking her, and Clemmons cancels the senior prom.', 'Y', 'N', 6.8),
	('Veronica Mars', 'Happy Go Lucky', 2, 21, 'Yes', 'Yes', 'Yes', 2, 5, 2006, 'Veronica takes the stand in Aaron Echolls\'s murder trial, and is distracted during final exams while waiting for the verdict. Meanwhile, Keith takes new evidence about the mayor to Lamb, and Weevil asks Mac and Cassidy for help to pass algebra.', 'Y', 'N', 6.9),
	('Veronica Mars', 'Not Pictured', 2, 22, 'Yes', 'Yes', 'Yes', 9, 5, 2006, 'After discovering the true perpetrator of the bus crash, Veronica is desperate to warn others before it\'s too late. However, she inadvertently puts herself and her loved ones at risk in the process. Meanwhile, Keith tracks down Woody in hiding, Wallace leaves for Paris to be with Jackie, and Weevil again runs into trouble with the law.', 'Y', 'N', 8),
	('Veronica Mars', 'Welcome Wagon', 3, 1, 'Yes', 'Yes', 'Yes', 3, 10, 2006, 'Veronica begins college with Logan, Wallace and Mac, but is immediately drawn back into old detective habits when Piz, Wallace\'s new roommate, gets all his stuff stolen. Meanwhile, Keith helps reunite Kendall with an old love, recently released from prison.', 'Y', 'N', 6.9),
	('Veronica Mars', 'My Big Fat Greek Rush Week', 3, 2, 'Yes', 'Yes', 'Yes', 10, 10, 2006, 'The campus newspaper hires Veronica for an undercover expose on the Zeta Theta sorority sisters during rush week to investigate Parkers rape. Veronica begins to realize though that not everything is as it appears in the sorority house. Logan and Wallace take part in a challenging Sociology class role-playing experiment as prisoner and prison guard, and Keith treks through the desert after escaping from the scene of a crime.', 'Y', 'N', 6.8),
	('Veronica Mars', 'Wichita Linebacker', 3, 3, 'Yes', 'Yes', 'Yes', 17, 10, 2006, 'Veronica\'s detective prowess is again used on campus when Piz\'s football friend loses the team playbook and Veronica must get it back before the game. The Dean threatens to expel Veronica if she doesn\'t reveal the source of her newspaper article. Meanwhile, Keith hires Weevil to work in the office, and Logan\'s antics catch up with him.', 'Y', 'N', 6.5),
	('Veronica Mars', 'Charlie Don\'t Surf', 3, 4, 'Yes', 'Yes', 'Yes', 24, 10, 2006, 'Logan gets a big surprise when he hires Veronica to find the source of his missing inheritance, which escalates from weird to worse. Meanwhile, Dick\'s fraternity asks Veronica to prove their innocence in the campus rapes, and Keith helps an old acquaintance prove her husband is cheating.', 'Y', 'N', 6.6),
	('Veronica Mars', 'President Evil', 3, 5, 'Yes', 'Yes', 'Yes', 31, 10, 2006, 'When the illegal casino Veronica frequents is robbed, she must track down the thief to recover the necklace Lilly gave her years before. Meanwhile, Dean O\'Dell\'s stepson is dying of cancer and needs Keith to track down his biological father for a transplant (with Cliff\'s help), and Wallace fears he may flunk out of his most important class.', 'Y', 'N', 6.7),
	('Veronica Mars', 'Hi, Infidelity', 3, 6, 'Yes', 'Yes', 'Yes', 7, 11, 2006, 'When Veronica\'s term paper appears on the internet, she is accused of cheating by the TA and must prove her innocence. Meanwhile, Wallace has problems of his own when long basketball practices distract him from his studies, and Keith begins seeing Harmony Chase.', 'Y', 'N', 6.8),
	('Veronica Mars', 'Of Vice And Men', 3, 7, 'Yes', 'Yes', 'Yes', 14, 11, 2006, 'Veronica helps a girl named Meryl who is certain that her boyfriend is in trouble, while a jaded Veronica tries to convince her that he is cheating. Meanwhile, Logan reluctantly tells Veronica why he is sure Mercer didn\'t commit the rapes, and Keith finds that there is a heavy price to pay for committing adultery.', 'Y', 'N', 6.7),
	('Veronica Mars', 'Lord Of The Pi\'s', 3, 8, 'Yes', 'Yes', 'Yes', 21, 11, 2006, 'Keith and Veronica are hired to help find the missing grand-daughter of the founder of Hearst College, whose swing vote could spell the end of fraternities and sororities at Hearst. Meanwhile, Logan fears for Veronica\'s safety as she gets closer to the truth regarding the campus rapes.', 'Y', 'N', 6.5),
	('Veronica Mars', 'Spit & Eggs', 3, 9, 'Yes', 'Yes', 'Yes', 28, 11, 2006, 'After the campus rapist anonymously announces the location of his next rape, Veronica hires her friends to help her track him down, but is shocked when she discovers the rapist\'s identity. Meanwhile, Logan makes a drastic decision about his future with Veronica, and Dean O\'Dell hires Keith to prove that his wife is unfaithful.', 'Y', 'N', 7.9),
	('Veronica Mars', 'Show Me The Monkey', 3, 10, 'Yes', 'Yes', 'Yes', 23, 1, 2007, 'Veronica and Mac help campus researchers locate a missing monkey who was allegedly stolen by animal rights activists. Meanwhile, Keith is approached by Mindy O\'Dell, who claims her husband\'s death was murder, not suicide. And in the aftermath of his breakup with Veronica, Logan turns to Dick for advice.', 'Y', 'N', 7),
	('Veronica Mars', 'Poughkeepsie, Tramps And Thieves', 3, 11, 'Yes', 'Yes', 'Yes', 30, 1, 2007, 'Veronica is hired to track down a one-night-stand, but the situation becomes more complicated when she turns out to be a hooker. Meanwhile, Keith continues his investigation in Dean O\'Dell\'s death, and a visit by Madison Sinclair causes trouble for Veronica and Logan.', 'Y', 'N', 6.8),
	('Veronica Mars', 'There\'s Got To Be A Morning After Pill', 3, 12, 'Yes', 'Yes', 'Yes', 6, 2, 2007, 'Veronica is hired to find out who slipped a classmate a drug causing her to have a miscarriage against her will, but is distracted by Logan who admits to sleeping with Madison Sinclair. Meanwhile, Keith helps Mindy O\'Dell when her ex-husband breaks into their house.', 'Y', 'N', 6.6),
	('Veronica Mars', 'Postgame Mortem', 3, 13, 'Yes', 'Yes', 'Yes', 13, 2, 2007, 'Keith takes on a second concurrent murder case when the head of the Hearst basketball team turns up dead and his son is the prime suspect. Meanwhile, a depressed Logan refuses to leave his hotel room and ends up babysitting Dick\'s girlfriend\'s little sister for days.', 'Y', 'N', 7),
	('Veronica Mars', 'Mars, Bars', 3, 14, 'Yes', 'Yes', 'Yes', 20, 2, 2007, 'When Veronica is released from jail, she is contacted by Josh Barry who is desperate to prove his innocence in his father\'s murder. Meanwhile, Keith gets bittersweet news from the county commissioner, and Logan helps Mac and Parker on a scavenger hunt.', 'Y', 'N', 7.5),
	('Veronica Mars', 'Papa\'s Cabin', 3, 15, 'Yes', 'Yes', 'Yes', 27, 2, 2007, 'When Veronica discovers Timothy Foyle breaking into Mars Investigations, she uses his help to track down Dean O\'Dell\'s true killer. Meanwhile, Logan and Parker\'s relationship takes an unexpected turn, and acting Sheriff Mars brings another murderer to justice.', 'Y', 'N', 7.5),
	('Veronica Mars', 'Un-American Graffiti', 3, 16, 'Yes', 'Yes', 'Yes', 1, 5, 2007, 'With Keith acting-sheriff, Veronica goes solo on a case involving a local restaurant whose owners are the targets of hate crimes. Meanwhile, Keith is disturbed by the lack of professionalism in his deputies when he orders them to fine bars serving alcohol to underage patrons. Logan throws a birthday party for Parker, and Piz decides to finally confront Veronica about his feelings.', 'Y', 'N', 7.2),
	('Veronica Mars', 'Debasement Tapes', 3, 17, 'Yes', 'Yes', 'Yes', 8, 5, 2007, 'Desmond Fellows, a singer/musician from a 1990s pop band arrives on the Hearst campus to perform at a benefit concert to keep the station from going out of business. Piz gets the job of his dreams when he is put in charge of hosting Fellows around campus and on air. However his dreams start to dissolve as things don\'t go quite how he imagined, in more ways then one. Keith is excited about the upcoming Sheriff\'s race unopposed until he unwittingly helps promote an unlikely candidate who throws his hat into the ring. ', 'Y', 'N', 7.6),
	('Veronica Mars', 'I Know What You\'ll Do Next Summer', 3, 18, 'Yes', 'Yes', 'Yes', 15, 5, 2007, 'Apollo, a Hearst student who suffered hardships as a child soldier in Africa, appears on Piz\'s radio show, prompting a man to come forth claiming to be his father. But Veronica\'s investigation unearths some surprises. Meanwhile, Neptune is faced with a crime spree that could spell trouble for Keith\'s campaign, and Logan finds himself in a difficult situation when Parker wants to spend to summer with him. Veronica awaits the results of her FBI exam.', 'Y', 'N', 7.5),
