	('Westworld', 'The Original', 1, 1, 'Yes', 'Yes', 'No', 2, 10, 2016, 'As another day of fantasy plays out in Westworld  a vast, remote park where guests pay top dollar to share wild-west adventures with android hosts  top programmer Bernard Lowe alerts park founder Dr. Robert Ford about incidents of aberrant behavior cropping up in some recently re-coded hosts. Meanwhile, in the Westworld town of Sweetwater, a ranchers daughter named Dolores encounters a gunslinger named Teddy in the street  but their predictable narrative is upended by the appearance of a ruthless Man in Black and, later, by a supporting hosts unscripted encounter with an artifact of the outside world.', 'N', 'N', 9),
	('Westworld', 'Chestnut', 1, 2, 'Yes', 'Yes', 'No', 9, 10, 2016, 'A pair of guests  first-timer William, and repeat visitor Logan  arrive at Westworld with different expectations and agendas. Bernard  and Quality Assurance head Theresa Cullen debate whether a recent host anomaly is contagious. Meanwhile, behavior engineer Elsie Hughes tweaks the emotions of Maeve, a madam in Sweetwaters brothel, in order to avoid a recall. Cocky programmer Lee Sizemore pitches his latest narrative to the team, but Dr. Ford has other ideas. The Man in Black conscripts a condemned man, Lawrence, to help him uncover Westworlds deepest secrets.', 'N', 'N', 8.6),
	('Westworld', 'The Stray', 1, 3, 'Yes', 'Yes', 'No', 16, 10, 2016, 'Elsie and Stubbs head into the hills in pursuit of a missing host. Teddy gets a new backstory, which sets him off in pursuit of a new villain, leaving Dolores alone in Sweetwater. Bernard investigates the origins of madness and hallucinations within the hosts. William finds an attraction hed like to pursue and drags Logan along for the ride.', 'N', 'N', 8.4),
	('Westworld', 'Dissonance Theory', 1, 4, 'Yes', 'Yes', 'No', 23, 10, 2016, 'Dolores joins William and Logan on a bounty hunt in the badlands. The Man in Black, with Lawrence in tow, finds a critical clue in his search to unlock the maze. Dr. Ford and Theresa discuss the future of the park. Maeve is troubled by a recurring vision.', 'N', 'N', 8.7),
