	('White Collar', 'Book Of Hours', 1, 3, 'Yes', 'Yes', 'Yes', 6, 11, 2009, 'The disappearance of a precious bible creates an interesting union when a New York Mafia kingpin enlists the help of Peter and the FBI in tracking down his beloved artifact. But while rooting out the thief, Neal finds himself in a tango with a sexy female villain and must decide where his loyalty truly lies.', 'Y', 'N', 7.8),
