	('White Collar', 'Bad Judgement', 1, 9, 'Yes', 'Yes', 'Yes', 26, 1, 2010, 'Peter is feeling good after a long weekend of relaxation, but his buzz is quashed when he returns to the office to see David Sullivan and his young daughter, Alison, waiting for him. Sullivan stood to inherit his recently deceased father\'s home, but the bank is foreclosing. Turns out, the old man took out a second mortgage before he passed away. Sullivan claims fraud, but the bank has a stack of paperwork, signed and notarized by his father. As Peter and Neal see the situation, it doesn\'t get much more cut and dry.', 'Y', 'N', 8.2),
