	('White Collar', 'Copycat Caffrey', 2, 3, 'Yes', 'Yes', 'Yes', 27, 7, 2010, 'Peter sends Neal back to school after someone copycats one of his old schemes. Alex returns with some bad news. Diana discovers the music box is hiding something. Peter and Diana set out to find the missing key, which is the last piece of the music box that Alex gives Neal before leaving for Italy. Aidan Quinn guest stars as a criminology professor. ', 'Y', 'N', 8.3),
